(395, 'Állítható toronycsapágy', 'Itt találhatók az állítható 2D és 3D toronycsapágyak. Ezek a prémium minőségű G-szemekkel felszerelt toronycsapágyak segítenek a kerék dőlésének, valamint a 3D verziónál az utánfutás pontos beállításában. Kifejezetten állítható magasságú futóművekhez ajánljuk őket!', '', '', '', 'állítható-toronycsapágy'),
(397, 'Cancell kit', 'A KW Cancell Kit modult olyan járművekhez tervezték, amelyek elektromos futóműszabályzással rendelkeznek, például bizonyos Audi, BMW, Opel, Porsche, Seat és Volkswagen modellekhez. Az elektronikus futóműszabályzással felszerelt autók esetében a gyári futómű eltávolítása vagy sport futóműre történő cseréje hibakódot generálhat, amit a KW Cancell Kit képes megszüntetni. A készlet lehetővé teszi, hogy bármely állítható vagy fix magasságú futómű hibakód mentesen használható legyen. A csomag tartalmazza a beépítéshez szükséges alkatrészeket és a szerelési útmutatót! Németországban készült, és TÜV minősítéssel rendelkezik!', '', '', '', 'cancel-kit'),
