INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(2, '', '<div>\r\n   <p>Az Audi A6 C4 típusokhoz tervezett egyedi MTS-Technik Street sport futómű ideális választás azok számára, akik minőségi és megfizethető termékeket keresnek. A futómű könnyedén állítható magassága rugalmasan alkalmazkodik az útviszonyokhoz, míg az MTS-Technik futóműveiben a rugók és lengéscsillapítók optimális egyensúlya biztosítja a kiváló teljesítményt.</p>\r\n   <p>Az állítható toronycsapágyak lehetővé teszik a kerék dőlésének beállítását, javítva ezzel az autó vezethetőségét és csökkentve a gumi kopását. Az alumínium ötvözetből készült MTS Technik toronycsapágyak CNC technológiával gyártottak, erősített G-szemmel ellátva a hosszú élettartam érdekében. Kompatibilisek a legtöbb állítható magasságú futóművel.</p>\r\n   <p>A futóművek rugóit az Eibach gyártja, melyek magassága szabadon állítható 25 és 80 mm között. A gáztöltetű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is. A futómű két rétegű bevonata hosszú távú korrózió ellen védelmet nyújt. A rugók és lengéscsillapítók tökéletes egyensúlya garantálja a kiváló teljesítményt. A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</p>\r\n   <p><img alt=\\\\\\\"\\\\\\\" src=\\\\\\\"https://www.futomushop.hu/images/streetmts.jpg\\\\\\\" /></p>\r\n   <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\r\n</div>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C4) Sedan Quattro és Avant Quattro, 1994.06-1997.10-ig, Street Series, Motorsport toronycsapágyakkal állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c4-sedan-quattro-es-avant-quattro-1994-06-1997-10-ig-street-series-motorsport-toronycsapagyakkal-allithato-magassagu-futomu'),
(3, '', '<div>\r\n  <p>Egyedi MTS-Technik állítható magasságú futóművek elérhetők az Audi A6 (C4) Sedan és Avant modellekhez. Ezek a futóművek ideális választások azok számára, akik minőségi terméket kedvező áron keresnek. A fokozatmentesen állítható magasság lehetővé teszi az autó alvázának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművek rugói és lengéscsillapítói optimális egyensúlyban vannak. Az első tengely terhelése 1240kg, míg a hátsó tengelyé 1200kg. Ezek a futóművek nem rendelkeznek TÜV engedéllyel.</p>\r\n</div>\r\n<div>\r\n  <p>A MTS Technik Motorsport első állítható toronycsapágyainak jellemzői: Az első toronycsapágy állíthatósága -2.5° és +0.5° között van, míg tömege 1100g. A hátsó toronycsapágy nem állítható, annak tömege 620g. Az MTS Technik állítható toronycsapágyak lehetővé teszik a kerék dőlésének beállítását, ezzel javítva az autó irányíthatóságát és csökkentve a gumi kopását. A toronycsapágyak alumínium ötvözetből készülnek, CNC technológiával gyártottak, erősített G-szemmel rendelkeznek hosszú élettartam érdekében, és kompatibilisek a legtöbb állítható magasságú futóművel.</p>\r\n</div>\r\n<div>\r\n  <p>A termék jellemzői: Az állítható magasságú futóművek rugóit az Eibach gyártja, a magasság szabadon állítható legtöbb esetben 25 és 80 mm között. A futóművek gáztöltetű lengéscsillapítókkal rendelkeznek, és magas hatékonyságot nyújtanak extrém körülmények között is. A két rétegű bevonatnak köszönhetően hosszú távú korrózióvédelem biztosított. A rugók és lengéscsillapítók tökéletes összhangban vannak egymással, a készlet pedig plug & play, így nem igényel módosítást az autó felfüggesztésében.</p>\r\n</div>\r\n<div>\r\n  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\r\n</div>\r\n<div>\r\n  <p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása tilos!</em></p>\r\n</div>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C4) Sedan és Avant, kivéve Quattro, 1994.06-1997.10-ig, Street Series, Motorsport toronycsapágyakkal állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c4-sedan-es-avant-kiveve-quattro-1994-06-1997-10-ig-street-series-motorsport-toronycsapagyakkal-allithato-magassagu-futomu'),
(4, '', '<p><strong>Audi 80 B2 MTS-Technik Street állítható magasságú sport futómű</strong></p>\n<ul>\n	<li>Az Audi 80 (B2 típus), 1.3 / 1.6 / 1.6 D / 1.6 TD / 1.8 / 1.8 GTE / 1.9 CD-5S / 2.0 motorváltozatokkal kompatibilis.</li>\n	<li>Nem kompatibilis Quattro változattal.</li>\n	<li>Elülső tengely maximális terhelése: 900kg.</li>\n	<li>Hátsó tengely maximális terhelése: 860kg.</li>\n	<li>Elülső ültetési tartomány: 45-85mm.</li>\n	<li>Hátsó ültetési tartomány: 25-95mm.</li>\n</ul>\n\n<p>A MTS-Technik állítható magasságú sport futóművei tökéletes választás azok számára, akik kiemelkedő minőséget és versenyképes árat keresnek! Az állítható magasság könnyen igazítható az útviszonyokhoz, a futómű rugói és lengéscsillapítói pedig tökéletes egyensúlyt biztosítanak.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Kiemelkedő hatékonyság extrém körülmények között is.</li>\n	<li>Dupla rétegű bevonat a hosszantartó korrózióvédelemért (sárga cinkbevonat és fekete anódizált alumínium alkatrészek).</li>\n	<li>Ideális egyensúly a rugók és lengéscsillapítók között.</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást a jármű felfüggesztésén.</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B2), kivéve Quattro, 1978.08-1987.03-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b2-kiveve-quattro-1978-08-1987-03-ig-street-series-allithato-magassagu-futomu'),
(5, '', '<p>Egy olyan Audi 80 B2 MTS-Technik Street sport futómű, amely könnyedén állítható a talajviszonyoknak megfelelően. Ideális megoldás azoknak, akik értékelik a minőséget és kedvező árakat. Az MTS-Technik futóművek kiváló egyensúlyt teremtenek a rugók és lengéscsillapítók között.</p>\\n\\n<p>A futómű rugóit az Eibach cég gyártja, és a magasság szabadon állítható 25-80 mm között. Gáztöltésű lengéscsillapítók magas hatékonysággal működnek extrém körülmények között is. Ezek a lengéscsillapítók két rétegű bevonattal rendelkeznek a hosszú élettartam érdekében. A futómű könnyen telepíthető, módosítás nélkül.</p>\\n\\n<p>A Motorsport első állítható toronycsapágya lehetővé teszi a kerék dőlésének beállítását, ezáltal javítva az autó vezethetőségét és csökkentve a gumiabroncs kopását. Az összes toronycsapágy alumínium ötvözetből készül CNC technológiával.</p>\\n\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B2), kivéve Quattro, 1978.08-1987.03-ig, Street Series, Motorsport toronycsapágyakkal állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b2-kiveve-quattro-1978-08-1987-03-ig-street-series-motorsport-toronycsapagyakkal-allithato-magassagu-futomu'),
(6, '', '<p><strong>Audi 80 B4 Cabrio MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>\\n<ul>\\n<li><strong>Audi 80 Cabrio (Típus: B4)</strong> számos motorváltozattal és gyártási évekkel, kivéve Quattro</li>\\n<li>A gyártási időszak 1991.05-től 2000.08-ig tartott</li>\\n<li>Az első ültetés magassága 15-65mm között állítható</li>\\n<li>A hátsó ültetés magassága 5-45mm között állítható</li>\\n<li>Az első tengely maximális terhelése: 1100kg</li>\\n<li>A hátsó tengely maximális terhelése: 870kg</li>\\n</ul>\\n<p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futóművek</strong> tökéletes választás azoknak, akik nem szeretnének engedményeket tenni. Az állítható magasságnak köszönhetően könnyen alkalmazkodhat az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> tökéletesen harmonizálnak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva a maximális vezetési élményt és a széles ültetési tartományt.</p>\\n<p><u>Termékjellemzők:</u></p>\\n<ul>\\n<li>A futóművek rugóit az <strong>Eibach</strong> cég gyártja</li>\\n<li>Különleges <strong>Eibach rugók</strong> a sportos teljesítményért</li>\\n<li>A <strong>Sport Series</strong> célja a széles ültetési tartomány és a fokozott vezetési élmény biztosítása</li>\\n<li>Gáztöltésű lengéscsillapítók</li>\\n<li>Magas hatékonyság extrém terhelés esetén</li>\\n<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\\n<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\\n<li>Plug & play készlet, nem igényel módosítást a felfüggesztésben</li>\\n</ul>\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></p>\\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B3) Coupé, 1988.10-1996.12-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b3-coupe-1988-10-1996-12-ig-sport-series-allithato-magassagu-futomu'),
(7, '', '<strong>Audi 80 B3 Sedan MTS-Technik Street Series állítható magasságú sport futómű</strong><br /><br /><p>Az Audi 80 Sedan (Typ: B3) modellek számára készült sport futómű, melyet a 1986.06-1991.10 közötti gyártási időszakra terveztek. Ez a futómű nem kompatibilis a Quattro változattal. Az ültetés mértéke elöl 15-65mm, míg hátul 5-45mm. Az első tengely terhelése 1100kg, míg a hátsó tengely terhelése 870kg.</p><br /><br /><p>Az állítható magasságú sport futóművek, melyeket az MTS-Technik fejlesztett ki, kiváló választást kínálnak azoknak, akik prémium minőséget szeretnének megfizethető áron. Ennek a futóműnek a magassága fokozatmentesen állítható, lehetővé téve a könnyű igazítást az útviszonyokhoz. Az MTS-Technik futóművei kiegyensúlyozott teljesítményt nyújtanak a rugók és lengéscsillapítók között.</p><br /><br /><p><u>Termékjellemzők:</u></p><br /><br /><ul><li>A futóművek rugóit az Eibach gyártja</li><li>A magasság általában 25 és 80 mm között szabadon állítható</li><li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém igénybevétel mellett is</li><li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li><li>A készlet plug & play, nem igényel autófelfüggesztés módosítást</li></ul><br /><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" style=\\\"height:314px; width:400px\\\" /></p><br /><br /><p><em>A weboldal tartalmának és képeinek jogtalan másolása szigorúan tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B3) Sedan, kivéve Quattro, 1986.06-1991.10-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b3-sedan-kiveve-quattro-1986-06-1991-10-ig-street-series-allithato-magassagu-futomu'),
(8, '', '<em>Audi 80 B3 Coupéhoz alkalmazható, állítható magasságú sport futómű</em><br /><ul><li><em>Audi 80 Coupé (B3 típus): 1.8 / 2.0 / 2.0 16V / 2.0 20V / 2.3 / 2.3 20V / 2.6 / 2.8</em></li><li><em>Gyártási év: 1988.10-1996.12</em></li><li><em>Kivéve Quattro változat</em></li><li><emElülső ültetési tartomány: 15-65mm</em></li><li><emHátsó ültetési tartomány: 5-45mm</em></li><li><em>Elülső tengely terhelése: 1100kg</em></li><li><em>Hátsó tengely terhelése: 870kg</em></li></ul><br /><p>Az MTS-Technik által gyártott sport futóművek ideális választás azoknak, akik értékelik a kiváló minőséget és ár-érték arányt. A futómű magassága folyamatosan állítható, így könnyedén igazítható az autó talajtól mért magassága az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimálisan vannak összehangolva.</p><br /><p><u>Termékjellemzők:</u></p><br /><ul><li>A futómű rugóit az <em>Eibach</em> gyártja</li><li>A magasság jellemzően 25 és 80 mm között tetszőlegesen beállítható</li><li>Gázos lengéscsillapítók</li><li>Kiemelkedő hatékonyság extrém körülmények között is</li><li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li><li>Tökéletes összhang a rugók és a lengéscsillapítók között</li><li>A készlet \"plug & play\", nem igényel módosítást az autó felfüggesztésén</li></ul><br /><p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" style=\"height:314px; width:400px\" /></p><br /><p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B3) Coupé, 1988.10-1996.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b3-coupe-1988-10-1996-12-ig-street-series-allithato-magassagu-futomu'),
(9, '', '<p><strong>Audi 80 B4 Cabrio MTS-Technik Sport Series állítható magasságú sport futómû</strong></p>  \n<ul>  \n	<li><strong>Az Audi 80 Cabrio (Typ: B4)</strong> modelljei: 1.8 / 2.0 E / 2.0 16V / 2.3 E / 2.6 / 2.8 / 1.9 TDI</li>  \n	<li>Évjárat: 1991.05-2000.08-ig</li>  \n	<li>Kivéve Quattro</li>  \n	<li>Ültetés mértéke elõl: 15-65mm</li>  \n	<li>Ültetés mértéke hátul: 5-45mm</li>  \n	<li>Elsõ tengely terhelés: 1100kg</li>  \n	<li>Hátsó tengely terhelés: 870kg</li> \n</ul>  \n\n<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futóművei</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy az autó hasmagassága könnyedén igazítható legyen az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> optimális összhangban vannak az <strong>Eibach gyártotta rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>  \n\n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>Speciális <strong>Eibach rugók</strong> a sportosság maximalizálása érdekében</li>  \n	<li>A <strong>Sport Series</strong> létrehozásakor a cél a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt</li>  \n	<li>Gáztöltésű lengéscsillapítók</li>  \n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>  \n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> \n</ul>  \n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>  \n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B3) Sedan, 1986.06-1991.10-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b3-sedan-1986-06-1991-10-ig-sport-series-allithato-magassagu-futomu'),
(10, '', '<strong>Audi 80 B4 Cabrio MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Audi 80 Cabrio (Típus: B4),</strong> 1.8 / 2.0 E / 2.0 16V / 2.3 E / 2.6 / 2.8 / 1.9 TDI</li> 	<li>Évjárat: 1991.05-2000.08-ig</li> 	<li>Kivéve Quattro</li> 	<li>Ültetés mértéke elöl: 15-65mm</li> 	<li>Ültetés mértéke hátul: 5-45mm</li> 	<li>Első tengely terhelés: 1100kg</li> 	<li>Hátsó tengely terhelés: 870kg</li> </ul>  <p>A <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> olyan megoldást nyújt az autótulajdonosoknak, akik nem szeretnének kompromisszumokat kötni. A magasság könnyedén állítható az útviszonyoknak megfelelően, így maximális vezetési élményt biztosít. Az <strong>MTS-Technik Sport futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, széles ültetési tartományt kínálva.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a sportosság érdekében</li> 	<li>A <strong>Sport Series</strong> célja a széles ültetési tartomány és a fokozott vezetési élmény</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevételek mellett is</li> 	<li>Korrózióvédelem két rétegű bevonattal</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, módosítások nélkül felszerelhető</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p> ', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Cabrio, 1991.05-2000.08-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-cabrio-1991-05-2000-08-ig-sport-series-allithato-magassagu-futomu'),
(11, '', '<p>Az Audi 80 MTS-Technik Street állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futóművek magassága fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n	<li>Audi 80 (Typ: B4) Sedan, 1.6 / 1.6E / 2.0 / 2.0E / 2.0E16V / 2.3E / 2.6 / 2.8 / 1.9TD / 1.9TDI</li>\n	<li>Kivéve Quattro</li>\n	<li>Elülső ültetés: 55-90mm</li>\n	<li>Hátsó ültetés: 35-70mm</li>\n	<li>Elülső tengely terhelése: 1080kg</li>\n	<li>Hátsó tengely terhelése: 1120kg</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Ideális egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Sedan, kivéve Quattro, 1991.09-1995.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-sedan-kiveve-quattro-1991-09-1995-07-ig-street-series-allithato-magassagu-futomu'),
(12, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek kiváló választást nyújtanak azoknak, akik számára fontos az optimális minőség és megfizethető ár. A futómű fokozatmentesen szabályozható magassága lehetővé teszi, hogy könnyedén igazítsa az autó hasmagasságát az adott útviszonyokhoz. Az MTS-Technik futóművei egyensúlyban tartják a rugók és a lengéscsillapítók teljesítményét.</p>\n<p><u>Az alábbi típusokhoz alkalmazható:</u></p>\n<ul>\n	<li><strong>Audi 80 (Typ: B4) Sedan,</strong> 1.6 / 1.6E / 2.0 / 2.0E / 2.0E16V / 2.3E / 2.6 / 2.8 / 1.9TD / 1.9TDI</li>\n	<li>Kivéve Quattro</li>\n	<li>Elülső ültetés: 55-90mm</li>\n	<li>Hátsó ültetés: 35-70mm</li>\n	<li>Elülső tengely terhelés: 1080kg</li>\n	<li>Hátsó tengely terhelés: 1120kg</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság legtöbb esetben 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Kiváló egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek jogtalan másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Avant, kivéve Quattro, 1991.09-1995.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-avant-kiveve-quattro-1991-09-1995-07-ig-street-series-allithato-magassagu-futomu'),
(13, '', '<strong>Állítható magasságú sport futómű az Audi 80-hoz MTS-Technik-től</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár! Az állítható magasságú futómű fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>A következő típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Audi 80 (Typ: B4) Avant,</strong> 2.0 E Quattro / S2 Quattro / RS2 Quattro / 2.3 E Quattro / 2.6 Quattro / 2.8 Quattro</li> 	<li>Elülső ültetés: 15-65mm</li> 	<li>Hátsó ültetés: 15-65mm</li> 	<li>Elülső tengely terhelése: 1100kg</li> 	<li>Hátsó tengely terhelése: 1120kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/7378998e389d0cac37fd42edda694d70/36253_106027.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/67d3d7b816459ecaa89d70a7db302bd2/36253_106026.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság többnyire 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes együttműködése</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>Weboldalunk szöveges és képi tartalmának engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Avant Quattro, beleértve S2 és RS2, 1991.09-1996.01-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-avant-quattro-beleertve-s2-es-rs2-1991-09-1996-01-ig-street-series-allithato-magassagu-futomu'),
(14, '', '<strong>Állítható magasságú sport futómű az Audi 80-hoz MTS-Technik Street</strong></p>  <p>A MTS-Technik által készített állítható magasságú sport futóművek kitűnő választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. A magasság fokozatmentesen állítható, megfelelően reagálva az útviszonyok változásaira, így könnyedén beállítható az autó hasmagassága. Az MTS-Technik futóművei kiváló összhangban vannak a rugók és a lengéscsillapítók között.</p>  <p><u>A következő Audi 80 típusokhoz passzol:</u></p>  <ul> 	<li><strong>Audi 80 (Typ: B4) Avant,</strong> 2.0 E Quattro / S2 Quattro / RS2 Quattro / 2.3 E Quattro / 2.6 Quattro / 2.8 Quattro</li> 	<li>Ültetés mértéke elöl: 15-65mm</li> 	<li>Ültetés mértéke hátul: 15-65mm</li> 	<li>Első tengely terhelés: 1100kg</li> 	<li>Hátsó tengely terhelés: 1120kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/7378998e389d0cac37fd42edda694d70/36253_106027.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/67d3d7b816459ecaa89d70a7db302bd2/36253_106026.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>gáztöltéses lengéscsillapítók</li> 	<li>kiemelkedő hatékonyság extrém körülmények között is</li> 	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Sedan Quattro, 1991.09-1995.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-sedan-quattro-1991-09-1995-07-ig-street-series-allithato-magassagu-futomu'),
(15, '', '<strong>Audi 80 B4 Cabrio MTS-Technik Comfort Series állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Audi 80 Cabrio (Typ: B4), </strong>1.8 / 2.0 E / 2.0 16V / 2.3 E / 2.6 / 2.8 / 1.9 TDI</li> 	<li>Évjárat: 1991.05-2000.08-ig</li> 	<li>Kivéve Quattro</li> 	<li>Ültetés mértéke elõl: 15-65mm</li> 	<li>Ültetés mértéke hátul: 5-45mm</li> 	<li>Elsõ tengely terhelés: 1100kg</li> 	<li>Hátsó tengely terhelés: 870kg</li> </ul>  <p>A <strong>MTS-Technik Comfort Series állítható magasságú sport futómű</strong>je ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az <strong>MTS-Technik Comfort futóművei</strong> tökéletes összhangban vannak az <strong>Eibach gyártmányú rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>.</p>  <p><u>Produktjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>Különleges <strong>Eibach rugók</strong> a maximális kényelemért</li> 	<li>A <strong>Comfort Series</strong> fejlesztésekor nem az extrém ültetés volt a fókuszban, hanem a <strong>magas kényelem</strong></li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></p>  <p><em>A weboldal szöveges tartalmainak, képeinek másolása, sokszorosítása tilos engedély nélkül!</em></p> ', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Cabrio, 1991.05-2000.08-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-cabrio-1991-05-2000-08-ig-comfort-series-allithato-magassagu-futomu'),
(16, '', '<strong>Audi 80 B4 Cabrio MTS-Technik Street Series állítható magasságú sport futómű</strong><br /><ul> <li><strong>Audi 80 Cabrio (Typ: B4), </strong>1.8 / 2.0 E / 2.0 16V / 2.3 E / 2.6 / 2.8 / 1.9 TDI</li> <li>Évjárat: 1991.05-2000.08-ig</li> <li>Kivéve Quattro</li> <li>Ültetés mértéke elöl: 15-65mm</li> <li>Ültetés mértéke hátul: 5-45mm</li> <li>Első tengely terhelés: 1100kg</li> <li>Hátsó tengely terhelés: 870kg</li> </ul><br /><p>Az MTS-Technik Street Series állítható magasságú sport futóművei olyan vezetőknek ajánlottak, akik kiemelten fontosnak tartják a prémium minőséget és megfizethető árat. Ez a futómű könnyedén állítható a megfelelő magasságra, így alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóművei a rugók és lengéscsillapítók tökéletes együttműködésével biztosítják az optimális teljesítményt.</p><br /><p><u>Termékjellemzők:</u></p><br /><ul> <li>az állítható magasságú futóművek rugóit a <strong>Eibach</strong> gyártja</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók biztosítják a kiváló teljesítményt</li> <li>magas hatékonyság szélsőséges körülmények között is</li> <li>két rétegű bevonat a tartósság érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> <li>tökéletes egyensúly a rugók és lengéscsillapítók között</li> <li>a készlet könnyen telepíthető, módosítás nélkül</li> </ul><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" style=\\\"height:314px; width:400px\\\" /></p><br /><p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi 80 (Typ: B4) Cabrio, 1991.05-2000.08-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-80-typ-b4-cabrio-1991-05-2000-08-ig-street-series-allithato-magassagu-futomu'),
(17, '', '<strong>Állítható Magasságú Futómű az Audi A1 típushoz</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: Audi A1 (Typ 8X)</li>\\r\\n	<li>Évjárat:.: 2010 -től</li>\\r\\n	<li>A futómű beállítása 30 - 60 mm között történik</li>\\r\\n	<li>Lehetséges az elülső és hátsó magasságának állítása</li>\\r\\n	<li>FK-Automotive AK Street futómű</li>\\r\\n	<li>Széles skálán állítható a magassága</li>\\r\\n	<li>Kiváló minőségű és tartós</li>\\r\\n	<li>Megfelel a német TÜV előírásainak</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n	<li>Cikkszám: SMVW9019-04</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A1 (Typ: 8X), 2010.08-tól állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a1-typ-8x-2010-08-tol-allithato-magassagu-futomu'),
(18, '', '<div>\\nKínálatunkban található magasságállítható sport futómű, amely ideális választás az Audi A1 V-Maxx modelljéhez.\\n</div>', 'V-Maxx Audi A1 (Typ: 8X), 2010.08-tól állítható magasságú futómű', '', '', '', 'v-maxx-audi-a1-typ-8x-2010-08-tol-allithato-magassagu-futomu'),
(19, '', '<p>A <strong>Volkswagen Polo 6R MTS-Technik Comfort Series állítható magasságú sport futómű</strong> kiváló választás azoknak, akik szeretnék kombinálni a sportos megjelenést és az utazási kényelmet. A futómű könnyedén állítható a megfelelő magasságra, így alkalmazkodik az útviszonyokhoz. Az <strong>MTS-Technik Comfort Series futóművek</strong> tökéletes összhangban vannak az <strong>Eibach</strong> rugókkal és lengéscsillapítókkal.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>a <strong>Comfort Series</strong> létrehozása során hangsúlyt fektettek a magas komfortra</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett</li>\n	<li>korrózióvédelem a sárga cink bevonatnak és fekete anodyzált alumínium alkatrészeknek köszönhetően</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A1 (Typ: 8X), beleértve Sportback, 2010.05-től, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a1-typ-8x-beleertve-sportback-2010-05-tol-comfort-series-allithato-magassagu-futomu'),
(20, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás lehetnek azok számára, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. A futóművekben az Eibach gyártotta rugók biztosítják a megfelelő szintű rugalmasságot, míg a gáztöltésű lengéscsillapítók hatékonyan kezelik az extrém terheléseket is. A kettős bevonatú felület hosszú távú korrózióvédelmet biztosít (sárga cink bevonat és fekete anodyzált alumínium alkatrészek). A futóművek tökéletes összhangot teremtenek a rugók és a lengéscsillapítók között, és a készlet könnyen telepíthető anélkül, hogy módosításokat kellene végrehajtani az autó felfüggesztésén.</p>', 'MTS-Technik by Nord Performance Audi A1 (Typ: 8X), beleértve Sportback, 2010.05-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a1-typ-8x-beleertve-sportback-2010-05-tol-street-series-allithato-magassagu-futomu'),
(21, '', '<div><span>Az Ap futómû lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy a kívánt ültetést milliméterre pontosan beállítsa. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</span></div> <div><span>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatja a TÜV által engedélyezett tartományban. A sportosság, a kényelem és a biztonság egyidejű összehangolása optimális felépítést eredményez.</span></div> <ul>     <li><span>kiváló minőség megfizethető áron</span></li>     <li><span>egyéni magasság beállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány<br type=\\\"_moz\\\" />     </span></li>     <li><span>egyedülálló ár/érték arány<br type=\\\"_moz\\\" />     </span></li>     <li><span>német minőség</span></li> </ul>', 'AP made by KW Audi A1 (Typ: 8X), 2010.08-tól, (első tengely terhelés 901-960kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a1-typ-8x-2010-08-tol-els-tengely-terheles-901-960kg-allithato-magassagu-futomu'),
(22, '', '<div> <p><strong>Állítható magasságú sport futómű az Audi A1 Vogtlandhoz</strong></p> <p>Az alábbi modellekhez: 1.2 TFSI, 1.4 TFSI, 1.6 TDI, 2.0 TDI</p> <p>Elülső ültetés mértéke: 15 - 40 mm</p> <p>Hátsó ültetés mértéke: 15 - 40 mm</p> <p> </p> <p>Elülső tengely maximális terhelése: 900 kg</p> <p>Hátsó tengely maximális terhelése: 840 kg</p> <p> </p> <p>Ez a termék rendelkezik TÜV engedéllyel!</p></div>', 'Vogtland Audi A1 (Typ: 8X), 2010.08-tól, (első tengely terhelés 900kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a1-typ-8x-2010-08-tol-els-tengely-terheles-900kg-alatt-allithato-magassagu-futomu'),
(23, '', '<div>  <strong>Vogtland állítható magasságú sport futómű az Audi A1-hez</strong></div> <div> </div> <div>Az alábbi típusokhoz használható: 1.2 TFSI, 1.4 TFSI, 1.6 TDI, 2.0 TDI</div> <div>Fedélzet ültetésének módosítási tartománya elöl: 30 - 60 mm</div> <div>Fedélzet ültetésének módosítási tartománya hátul: 25 - 50 mm</div> <div> </div> <div>Elülső tengely terhelési határ: 901 - 960 kg</div> <div>Hátsó tengely terhelési határ: 840 kg vagy annál kevesebb</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Audi A1 (Typ: 8X), 2010.08-tól, (első tengely terhelés 901-960kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a1-typ-8x-2010-08-tol-els-tengely-terheles-901-960kg-allithato-magassagu-futomu'),
(24, '', '<div>\\r\\n<div>Az Ap futómű megoldást nyújt a sportosan ambiciózus vezetőknek, akik precízen szeretnék beállítani az autójuk magasságát. A sportos irányíthatóság és a kiváló vezetési tulajdonságok mellett a maximális ültetés lehetőségét biztosítjuk.</div>\\r\\n\\r\\n<div>Az alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. Ennek eredményeként a sportosság, kényelem és biztonság tökéletes összhangban lesznek.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termék megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiváló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n</div>\\r\\n', 'AP made by KW Audi A1 (Typ: 8X), 2010.08-tól, (első tengely terhelés 900kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a1-typ-8x-2010-08-tol-els-tengely-terheles-900kg-alatt-allithato-magassagu-futomu'),
(25, '', '<div><strong>Volkswagen Polo 6R Bilstein B14 sport futómű állítható magassággal</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a futómű kompatibilis a következő típusokkal: 1.2, 1.2 TDI, 1.2 TSI, 1.4, 1.4 BiFuel, 1.4 GTi, 1.4 TSI, 1.6, 1.6 BiFuel, 1.6 TDI</div>\\r\\n\\r\\n<div>Az ültetés mértéke az első tengelyen: 30 - 45 mm</div>\\r\\n\\r\\n<div>Az ültetés mértéke a hátsó tengelyen: 30 - 45 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely terhelése: 960 kg alatt</div>\\r\\n\\r\\n<div>A hátsó tengely terhelése: 800 kg alatt</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel!</div>\\r\\n', 'Bilstein Audi A1 (Typ: 8X), 2010.08-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a1-typ-8x-2010-08-tol-bilstein-b14-allithato-magassagu-futomu'),
(26, '', '<div> <p><strong>Volkswagen Polo 6R Bilstein B16 PSS9 állítható magasságú és keménységű sport futómű</strong></p>  <p>A Volkswagen Polo 6R modellekhez kínált Bilstein B16 PSS9 sport futómű, amelynek beállítható magassága és keménysége ideális választás a következő motorváltozatokhoz: 1.2, 1.2 TDI, 1.2 TSI, 1.4, 1.4 BiFuel, 1.4 GTi, 1.4 TSI, 1.6, 1.6 BiFuel, 1.6 TDI.</p>  <p>Ültetés mértéke az első és hátsó tengelyen egyaránt 30 - 45 mm között állítható, míg az első tengely terhelése 960 kg alatt, a hátsó tengely terhelése pedig 800 kg alatt marad.</p>  <p>A Bilstein B16 PSS9 futómű rendelkezik TÜV engedéllyel, biztosítva a termék minőségét és megbízhatóságát.</p>  <p> </p>  <p><strong>BILSTEIN B16 PSS9</strong></p>  <p>A Bilstein B16 PSS9 futómű egyedülálló technológiai megoldásokat kínál, beleértve az egycsöves rendszert és az upside-down technológiát. A versenysport rugók nagy szilárdságú anyagokból készülnek, míg az állítható magasság lehetővé teszi a rugótányér és a kontra anya alumíniumból történő gyártását.</p>  <p>A húzó és nyomófokozat egyidejűleg 9 fokozatban állítható, így a futómű beállítása maximális precizitással történhet.</p>  <p>A B16 PSS9 futómű lehetővé teszi a jármű magasságának akár 50 mm-rel történő csökkentését az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. A beépített állapotban található beállító kerék segítségével 9 karakterisztika közül választhat, így biztosítva a jármű professzionális beállítását minden körülmények között.</p> </div>  <div> </div>', 'Bilstein Audi A1 (Typ: 8X), 2010.08-tól, Bilstein B16, állítható keménységű  állítható magasságú futómű', '', '', '', 'bilstein-audi-a1-typ-8x-2010-08-tol-bilstein-b16-allithato-kemenysegu--allithato-magassagu-futomu'),
(27, '', '<p>A Volkswagen Polo 6 Street Series MTS-Technik állítható magasságú sport futóműve az AW és BZ típusú Volkswagen Polo 6 modellekhez készült. Ez a futómű alkalmas 1.0, 1.0MPi, 1.0TGI, 1.0TSI, 1.5TSI, 2.0GTI és 1.6TDI motorokhoz. A futómű ültetési mértéke elöl 25-60 mm, míg hátul 25-50 mm. Az első tengely terhelése 1010 kg, míg a hátsó tengelyé 930 kg. Fontos tudni, hogy a termék TÜV engedéllyel rendelkezik.</p>\n\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akiknek fontos a jó minőség és az kedvező ár. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi A1 (Typ: GB) Sportback, 25TFSi, 30TFSi, 35TFSi, 40TFSi, 2018.07-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a1-typ-gb-sportback-25tfsi-30tfsi-35tfsi-40tfsi-2018-07-tol-street-series-allithato-magassagu-futomu'),
(28, '', '<p><strong>Változtatható magasságú sport futómű az Audi A1 modellhez</strong></p>\\n<ul>\\n<li>Az Audi A1 Sportback modellekhez kapható</li>\\n<li>Kompatibilis típusok: 25TFSi, 30TFSTFsi, 40TFSi</li>\\n<li>Rendszám: GB</li>\\n<li>Elülső ültetési tartomány: 40 - 70 mm</li>\\n<li>Hátsó ültetési tartomány: 40 - 70 mm</li>\\n<li>A futómű TÜV engedéllyel rendelkezik</li>\\n</ul>', 'V-Maxx Audi A1 (Typ: GB) Sportback, 25TFSi, 30TFSi, 35TFSi, 40TFSi, 2018.07-től állítható magasságú futómű', '', '', '', 'v-maxx-audi-a1-typ-gb-sportback-25tfsi-30tfsi-35tfsi-40tfsi-2018-07-tol-allithato-magassagu-futomu'),
(29, '', '<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem is. A magasság fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik Comfort futóművei tökéletes egyensúlyban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>a Comfort Series kialakításakor nem a extrém leültetés, hanem a magas kényelem volt a fókuszban</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A1 (Typ: GB) Sportback, 25TFSi, 30TFSi, 35TFSi, 40TFSi, 2018.07-től, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a1-typ-gb-sportback-25tfsi-30tfsi-35tfsi-40tfsi-2018-07-tol-comfort-series-allithato-magassagu-futomu'),
(30, '', '<p><strong>Volkswagen Polo 6 Sport Series MTS-Technik állítható magasságú sport futómű</strong></p>\n<ul>\n	<li><strong>Volkswagen Polo 6 (Typ: AW, BZ),</strong> 1.0 / 1.0MPi / 1.0TGI / 1.0TSI / 1.5TSI / 2.0GTI / 1.6TDI</li>\n	<li>Ültetés mértéke elöl: 25-55mm</li>\n	<li>Ültetés mértéke hátul: 25-50mm</li>\n	<li>Első tengely terhelés: 1010kg</li>\n	<li>Hátsó tengely terhelés: 930kg</li>\n	<li>A termék TÜV engedéllyel rendelkezik!</li>\n</ul>\n<p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport állítható futóművei</strong> a <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong> tökéletes összhangban vannak, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a sportosság érdekében</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a fő cél</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém körülmények között is</li>\n	<li>két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi A1 (Typ: GB) Sportback, 25TFSi, 30TFSi, 35TFSi, 40TFSi, 2018.07-től, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a1-typ-gb-sportback-25tfsi-30tfsi-35tfsi-40tfsi-2018-07-tol-sport-series-allithato-magassagu-futomu'),
(31, '', '<p><strong>Az Audi A1 V-Maxx sport futóműve testreszabható magasságú és rugalmasságú.</strong></p><br /><ul><li>Audi A1 Sportback modellekhez, 25TFSi, 30TFSTFSi, 40TFSi motorokkal</li><li>Típus: GB</li><li>Az elülső rész magassága 40 - 70 mm között változtatható</li><li>A hátsó rész magassága 40 - 70 mm között állítható</li><li>Rugalmassága 20 fokozatban szabályozható</li><li><strong>A rövidített stabilizátor rúd ajánlott.</strong></li><li>A futómű megfelel a TÜV előírásainak</li></ul>', 'V-Maxx Audi A1 (Typ: GB) Sportback, 25TFSi, 30TFSi, 35TFSi, 40TFSi, 2018.07-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-a1-typ-gb-sportback-25tfsi-30tfsi-35tfsi-40tfsi-2018-07-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(32, '', '<strong>Audi A2 JOM BLUE LINE állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>Ez a sport futómű az Audi A2 típusokhoz készült az években 1999-2005.</p>\\r\\n\\r\\n<p>Kérjük, vegye figyelembe, hogy ez a futómű nem kompatibilis a 1.2 TDI és 3 hengeres típusokkal!</p>\\r\\n\\r\\n<p>A magasságállító a hátsó tengelynél a rugó alatt található.</p>\\r\\n\\r\\n<p>A futómű beszereléséhez javasoljuk a rövidített stabilizátor rúd (kutyacsont) használatát, ami nem része ennek a szettnek!</p>\\r\\n\\r\\n<p>A tengelyterhelés elöl 960 kg, míg hátul 840 kg.</p>\\r\\n\\r\\n<p>Ez a termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, amit a csomag tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>A futómű kiváló minőségű, és rendkívül jó áron kapható!</p>\\r\\n\\r\\n<p>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot.</p>\\r\\n', 'Jom Bochum Audi A2 (Typ: 8Z), kivéve 1.2 TDi, 1999-2005-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a2-typ-8z-kiveve-1-2-tdi-1999-2005-ig-blue-line-allithato-magassagu-futomu'),
(33, '', '<strong>MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azok számára, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyen igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik Sport állítható futóművei tökéletes egyensúlyban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva a maximális vezetési élményt és széles ültetési tartományt.</p>  <p><u>A következő típusokhoz ajánlott:</u></p>  <ul> 	<li>Skoda Fabia, 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> 	<li>Ültetés mértéke elöl: 50-80mm</li> 	<li>Ültetés mértéke hátul: 50-90mm</li> 	<li>Első tengely terhelés: 960kg</li> 	<li>Hátsó tengely terhelés: 840kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók maximális sportossághoz</li> 	<li>A Sport Series megalkotásakor a széles ültetési tartomány és a fokozott vezetési élmény volt a fő szempont</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Audi A2 (Typ: 8Z), 2000.02-2005.08-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a2-typ-8z-2000-02-2005-08-ig-sport-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(34, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p> <p><u>A futóművek alkalmasak a következő típusokhoz:</u></p> <ul> <li>Skoda Fabia 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> <li>Elülső ültetés: 15-60mm</li> <li>Hátsó ültetés: 15-60mm</li> <li>Elülső tengely terhelés: 960kg</li> <li>Hátsó tengely terhelés: 840kg</li> </ul> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművek rugóit az Eibach gyártja</li> <li>A magasság szabadon állítható általában 25 és 80 mm között</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Magas hatékonyság extrém terhelés mellett is</li> <li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li> <li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> <li>A készlet plug & play, nem igényel módosításokat az autó felfüggesztésében</li> </ul> <p><u><strong>Termék jellemzői:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Audi A2 (Typ: 8Z), 2000.02-2005.08-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a2-typ-8z-2000-02-2005-08-ig-street-series-allithato-magassagu-futomu'),
(35, '', '<p>Egyedi Audi A3 JOM BLUE LINE sport futómű, melynek magassága állítható</p>\\r\\n\\r\\n<p>1996-tól 2003-ig gyártott modellekhez</p>\\r\\n\\r\\n<p>8L típus</p>\\r\\n\\r\\n<p>Elöl: 1020 kg tengelyterhelés</p>\\r\\n\\r\\n<p>Hátul: 1025 kg tengelyterhelés</p>\\r\\n\\r\\n<p>Figyelem: Nem kompatibilis Quattro modellekkel!</p>\\r\\n\\r\\n<p>A futómű hátsó részén a magasságállító a rugó alatt található</p>\\r\\n\\r\\n<p>Gyártva Németországban</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német TÜV engedéllyel, amelyet a csomag tartalmaz</p>\\r\\n\\r\\n<p>2 év teljes körű garancia!!!</p>\\r\\n\\r\\n<p>Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulccsal</p>\\r\\n\\r\\n<p>Kiemelkedő minőség, rendkívül kedvező áron!!!</p>\\r\\n\\r\\n<p>A szett tartalma: 4 lengéscsillapító a hozzá tartozó rugókkal és 1 állítókulccsal</p>', 'Jom Bochum Audi A3 (Typ: 8L), kivéve Quattro, 1996-2003-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a3-typ-8l-kiveve-quattro-1996-2003-ig-blue-line-allithato-magassagu-futomu'),
(36, '', '<p><strong>Felhúzható Magasságú Futómű az Audi A3-hoz</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Járműtípus: Audi A3 (Typ.: 8L)</li>\\r\\n	<li>Gyártási időszak: 1996.08 - 2003</li>\\r\\n	<li>Nem vonatkozik: Quattro</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Az ültetési magasság 35 - 55 mm között állítható</li>\\r\\n	<li>Elől és hátul is módosítható a magasság</li>\\r\\n	<li>FK-Automotive AK Street futómű</li>\\r\\n	<li>Széles skálán állítható magasság</li>\\r\\n	<li>Sportos, kemény és tartós</li>\\r\\n	<li>Német TÜV engedéllyel jelenleg nem rendelkezik</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n	<li>Cikkszám: SMAI8003</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A3 (Typ: 8L), kivéve Quattro, 1996-2003-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a3-typ-8l-kiveve-quattro-1996-2003-ig-allithato-magassagu-futomu'),
(37, '', '<div> \\n<p>Az Audi A3 (8L típusú) autóhoz készült V-Maxx sport futómű állítható magasságú. </p>', 'V-Maxx Audi A3 (Typ: 8L), összes, kivéve Quattro, 1996.09-2003.05-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8l-osszes-kiveve-quattro-1996-09-2003-05-ig-allithato-magassagu-futomu'),
(38, '', '<strong>Audi A3 FK-Automotive Állítható Magasságú és Rugalmas Futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Járműtípus: Audi A3 (Typ.: 8L)</li>\\r\\n	<li>Gyártási év: 1996.08 - 2003</li>\\r\\n	<li>Kizárva: Quattro</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Az ültetés mértéke körülbelül: 35 - 55 mm között szabályozható</li>\\r\\n	<li>Első tengely terhelése: 1010kg</li>\\r\\n	<li>Hátsó tengely terhelése: 985kg</li>\\r\\n	<li>Elöl és hátul egyaránt állítható a magassága</li>\\r\\n	<li><strong>Flexibilis keménységű változat!</strong></li>\\r\\n	<li>Széles skálán állítható a magassága</li>\\r\\n	<li>Sportos, dinamikus és tartós</li>\\r\\n	<li>Német nyelvű TÜV engedéllyel rendelkezik</li>\\r\\n	<li>Alapanyag: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A3 (Typ: 8L), kivéve Quattro, 1996-2003-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a3-typ-8l-kiveve-quattro-1996-2003-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(39, '', '<p><strong>Audi A3 FK-Automotive Állítható Magasságú Futómû</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: Audi A3 (Typ.: 8L)</li>\\r\\n	<li>Évjárat: 1996.08 - 2003</li>\\r\\n	<li>Kivéve: Quattro</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Az ültetés mértéke körülbelül 35 - 55 mm között változtatható</li>\\r\\n	<li>Elsõ tengely terhelése: 1010kg</li>\\r\\n	<li>Hátsó tengely terhelése: 985kg</li>\\r\\n	<li>Elöl és hátul is módosítható a magassága</li>\\r\\n	<li><strong>Nem rozsdásodó anyagból készült!</strong></li>\\r\\n	<li\"Nagy tartományban állítható a magassága/li>\\r\\n	<li>Sportos, feszes és ellenálló kialakítású</li>\\r\\n	<li>Biztosított német nyelvû TÜV engedéllyel</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A3 (Typ: 8L), kivéve Quattro, 1996-2003-ig, rozsdamentes állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a3-typ-8l-kiveve-quattro-1996-2003-ig-rozsdamentes-allithato-magassagu-futomu'),
(40, '', '<strong>Volkswagen Golf 4 MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  <p><u>Az alábbi típusokhoz illeszkedik:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Beleértve a Variant változatot</li> 	<li>Kivéve a 4-Motion verziót</li> 	<li>Az első tengely maximális terhelése: 1030kg</li> 	<li>A hátsó tengely maximális terhelése: 1025kg</li> </ul>  <p>A <strong>MTS-Technik Comfort sorozatú állítható magasságú sport futómű</strong> ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem. A fokozatmentesen állítható magasság lehetővé teszi az autó alvázának könnyű beállítását az útviszonyoknak megfelelően. Az <strong>MTS-Technik Comfort futóművei</strong> tökéletes egyensúlyt teremtenek az <strong>Eibach</strong> gyártotta rugók és az <strong>MTS-Technik</strong> lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> vállalat gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>A <strong>Comfort sorozat</strong> kialakításakor hangsúlyt fektettek a <strong>magas kényelemre</strong>, nem az extrém alacsonyra ültetésre</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Optimális egyensúly rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása szigorúan tilos!</em></p> ', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8L), kivéve Quattro és S3, 1996-2003-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8l-kiveve-quattro-es-s3-1996-2003-ig-comfort-series-allithato-magassagu-futomu'),
(41, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a futómű rugóit az Eibach gyártja</li> 	<li>a magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiváló hatékonyság extrém terhelés esetén is</li> 	<li>két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>optimális rugó-lengéscsillapító összhang</li> 	<li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8L) Quattro, beleértve S3, 1996.12-2003.05-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8l-quattro-beleertve-s3-1996-12-2003-05-ig-street-series-allithato-magassagu-futomu'),
(42, '', '<div>\\nOlyan termék, ami a személygépkocsi futóművének magasságát szabályozhatóvá teszi, és céges kategóriába sorolható.\\n</div>', 'V-Maxx Audi A3 (Typ: 8L), Quattro, 1996.12-2003.05-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8l-quattro-1996-12-2003-05-ig-allithato-magassagu-futomu'),
(43, '', '<strong>Volkswagen Golf 4 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p><u>Az alábbi típusokhoz illik:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Beleértve Variant</li> 	<li>Kivéve 4-Motion</li> 	<li>Első tengely terhelés: 1030kg</li> 	<li>Hátsó tengely terhelés: 1025kg</li> </ul>  <p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futómű</strong> kiváló választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság könnyedén beállítható az útviszonyoknak megfelelően, így biztosítva az optimális vezetési élményt és széles ültetési tartományt!</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>A <strong>Sport sorozat</strong> létrehozása során a cél a széles ültetési tartomány és a fokozott vezetési élmény elérése volt</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8L), kivéve Quattro és S3, 1996-2003-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8l-kiveve-quattro-es-s3-1996-2003-ig-sport-series-allithato-magassagu-futomu'),
(44, '', '<p><strong>Audi A3 MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>\n\n<p><u>A következő típuskhoz passzol:</u></p>\n\n<ul>\n	<li><strong>Audi A3 (Typ: 8L), </strong>1.8T Quattro / S3 / 1.9TDI Quattro</li>\n	<li>Első tengely terhelés: 1110kg</li>\n	<li>Hátsó tengely terhelés: 1080kg</li>\n	<li>Rugó erősség (első, fő rugó): 90 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 100 - 120 N/mm</li>\n	<li>TÜV engedéllyel rendelkezik!</li>\n</ul>\n\n<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futóművei</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosságért</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a széles ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8L) Quattro, beleértve S3, 1996.12-2003.05-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8l-quattro-beleertve-s3-1996-12-2003-05-ig-sport-series-allithato-magassagu-futomu'),
(45, '', '<div>\n<p>\n<em>Audi A3 (8L típus) autóhoz készült sport futómű, melynek magassága állítható</em>\n</p>', 'V-Maxx Audi A3 (Typ: 8L), összes, kivéve Quattro, 1996.09-2003.05-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8l-osszes-kiveve-quattro-1996-09-2003-05-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(46, '', '<p><strong>Vogtland</strong><span> által kifejlesztett állítható magasságú futómű szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>: 1996.09-2003.05</li>     <li><strong>Ültetés mértéke</strong>: 30 - 50 / 30 - 50 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8L, 2WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: 1020 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1025 kg</li>     <li> </li> </ul> <p>Az autó megjelenésének javítása mellett a Vogtland futómű szett magas szintű vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint könnyedén beállíthatja. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikát biztosítanak. A lengéscsillapítók kiváló korrózió elleni védelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát biztosít az ültető rugókra és a lengéscsillapítókra!</p> <p>A szett alapvetően tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968200</p>', 'Vogtland Audi A3 (Typ: 8L), kivéve Quattro, 1996.09-2003.05-ig állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8l-kiveve-quattro-1996-09-2003-05-ig-allithato-magassagu-futomu'),
(47, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: AUDI A3</p>\n<ul>\n    <li><strong>Évjárat</strong>: 1996-2003</li>\n    <li><strong>Ültetés mértéke</strong>: 25 - 50 / 25 50 mm</li>\n    <li><strong>Típus</strong>: Audi A3, Typ 8L, Quattro</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 1040 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét a megfelelő értékek között saját elképzelése szerint állíthatja. A futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme elsőosztályú.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968301</p>', 'Vogtland Audi A3 (Typ: 8L) Quattro, 1996.12-2003-ig állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8l-quattro-1996-12-2003-ig-allithato-magassagu-futomu'),
(48, '', '<div>\n<p>Egy olyan sport futómű, amely lehetővé teszi az egyedi magasságállítást, speciálisan tervezve az Audi A3 (Typ: 8L) modellhez.</p>\n</div>', 'V-Maxx Audi A3 (Typ: 8L), Quattro, 1996.12-2003.05-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8l-quattro-1996-12-2003-05-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(49, '', '<div>\\r\\n<p>Ez a moduláris AP-Fahrwerke Állítható magasságú futómû egy megbízható választás a Volkswagen Golf 4 típushoz.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Azonosító: 1J</li>\\r\\n	<li>Nem kompatibilis: 4-Motion és Variant</li>\\r\\n	<li>Elérhető: 1997.10-től</li>\\r\\n	<li>Tömegeloszlás elöl (kg): 1020</li>\\r\\n	<li>Tömegeloszlás hátul (kg): 1020</li>\\r\\n	<li>Fontos megjegyzés: Az eredeti gumiabroncs-felni kombinációknál nyomtávszélesítő szükséges!<br />\\r\\n	Az 50 mm-nél nagyobb átmérőjű lengőkarok esetén javasolt a stabilizátorrúd cseréje! Ennek célja a jobb féltengely mozgékonyságának biztosítása a futóműcsere után. Az alkatrészek cikkszáma: Xenon fényszóró nélküli modellekhez: ZB50-017, Xenon fényszórós modellekhez: ZB50-017.</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműkészlet rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedély által szabályozott ültetés: elöl 30-65 mm, hátul 30-65 mm között állítható<br />\\r\\n	(Mindig nagyobb intervallumban állítható, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li>\\r\\n	<li>További ültetési lehetőségek: elöl +45 mm, hátul +5 mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártó: Ap-Fahrwerke Németország</li>\\r\\n	<li>Garancia: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Termékazonosító: GF10-005</strong></p>\\r\\n\\r\\n<p><br />\\r\\nAz ár egy szettre vonatkozik!</p>\\r\\n</div>\\r\\n', 'AP made by KW Audi A3 (Typ: 8L), összes, kivéve Quattro, 1996.09-2003.05-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8l-osszes-kiveve-quattro-1996-09-2003-05-ig-allithato-magassagu-futomu'),
(50, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A3</p>  \n<ul>  \n	<li><strong>Évjárat</strong>: 1999.06-2003-ig</li>  \n	<li><strong>Ültetés mértéke</strong>: 25 - 50 / 25 50 mm</li>  \n	<li><strong>Típus</strong>: Audi A3, Typ 8L, beleértve S3</li>  \n	<li><strong>Max. tengelyterhelés elõl</strong>: 1040 kg</li>  \n	<li><strong>Max. tengelyterhelés hátu</strong>l: 1050 kg</li>  \n</ul>  \n<p>Az autó kinézetén javítva, kiváló vezetési élményt nyújt. A magasságot az egyéni igényeknek megfelelően lehet beállítani. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és dinamikus vezetést biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék TÜV minősítéssel rendelkezik. A gyártó cég több mint 100 éves tapasztalattal a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  \n<p>A csomag alapvetően 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóműves autókat.</p>  \n<p>Készült Németországban!</p>  \n<p>Cikkszám: 968302</p>  ', 'Vogtland Audi S3 (Typ: 8L), 1999.06-2003-ig állítható magasságú futómű', '', '', '', 'vogtland-audi-s3-typ-8l-1999-06-2003-ig-allithato-magassagu-futomu'),
(51, '', '<div>\n  <p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n  <ul>\n    <li>VW Golf 4 4WD, Limousine, Variant 4 és 5 hengeres</li>\n    <li>Tipuskód: 1J</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 1999.04-től</li>\n    <li>Tengelyterhelés elöl (kg): 1050</li>\n    <li>Tengelyterhelés hátul (kg): 1060</li>\n    <li>Egyéb kitételek: -</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-55 mm, hátul: 30-55 mm között állítható<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n    <li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: Ap-Fahrwerke Németország</li>\n    <li>Garancia időtartama: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF80-031</strong></p>\n  <p><br />\n  Az ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Audi A3 (Typ: 8L), Quattro, beleértve S3, 1996.12-2003.05-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8l-quattro-beleertve-s3-1996-12-2003-05-ig-allithato-magassagu-futomu'),
(52, '', '<strong>Bilstein B14 állítható magasságú sport futómű</strong><br /> <br /> Az egyedi BILSTEIN egycsöves rendszerrel rendelkező futómű Upside-Down technológiával van ellátva. A versenysportrugók nagy szilárdságú anyagból készülnek, és lehetőséget biztosítanak az állítható magasságra, melynek elemi részei alumíniumból készültek. A B14-gyel a BILSTEIN mérnökei a versenysport technológiát vitték az utcára, megteremtve ezzel az óriási előnyt. A B14 PSS-nél a jármű magassága az első és hátsó tengelynél akár 50 mm-rel csökkenthető, ezen belül egy 20mm-es állítási tartományban. Az extrém terhelhetőségű B14 PSS egyedülálló egycsöves Upside-Down technológiával rendelkezik, mely biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmények között.</p>', 'Bilstein Audi A3 (Typ: 8L), Quattro, 1996.12-2003.05-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a3-typ-8l-quattro-1996-12-2003-05-ig-bilstein-b14-allithato-magassagu-futomu'),
(53, '', '<div><strong>Volkswagen Golf 4 Bilstein B14 sport futómű állítható magassággal</strong></div>  \n<div> </div>  \n<div>Elülső ültetés módosítási tartomány: 25 - 45 mm</div>  \n<div>Hátsó ültetés módosítási tartomány: 20 - 40 mm</div>  \n<div> </div>  \n<div>Maximális terhelés az első tengelyen: 1060 kg</div>  \n<div>Maximális terhelés a hátsó tengelyen: 1010 kg</div>  \n<div> </div>  \n<div>Ez a termék rendelkezik TÜV engedéllyel!</div>  \n<div> </div>  \n<div> </div>  \n<div> </div>  ', 'Bilstein Audi A3 (Typ: 8L), összes, kivéve Quattro, 1996.09-2003.05-ig,  Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a3-typ-8l-osszes-kiveve-quattro-1996-09-2003-05-ig--bilstein-b14-allithato-magassagu-futomu'),
(54, '', '<p>Egy olyan sportos futómű, melynek magassága állítható</p>\\r\\n\\r\\n<p>Típus: 8P</p>\\r\\n\\r\\n<p>Nem alkalmazható Quattro modellekhez</p>\\r\\n\\r\\n<p>Gyártási év: 2003-tól</p>\\r\\n\\r\\n<p>FONTOS! A futómű telepítéséhez szükséges egy rövid stabilizátor rúd (kutyacsont), amely nem része ennek a szettnek!!</p>\\r\\n\\r\\n<p>Tengelyterhelés elöl: 1200 kg</p>\\r\\n\\r\\n<p>Tengelyterhelés hátul: 990 kg</p>\\r\\n\\r\\n<p>NÉMETORSZÁGBAN GYÁRTVA</p>\\r\\n\\r\\n<p>2 ÉVES TELJES KÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>Kiemelkedő minőség, rendkívül kedvező áron!!!</p>\\r\\n\\r\\n<p>A csomag tartalma: 4 db lengéscsillapító, hozzájuk tartozó rugókkal, valamint az állításhoz szükséges 1 db kulccsal</p>\\r\\n\\r\\n<p><u><strong>TÜV engedély:</strong></u></p>\\r\\n\\r\\n<p><a href=\\\"https://www.jom.de/media/files_public/716b59ea817a524fbb3ab0042fedfe8f/741041_741036%20update%202.pdf\\\">https://www.jom.de/media/files_public/716b59ea817a524fbb3ab0042fedfe8f/741041_741036%20update%202.pdf</a></p>\\r\\n', 'Jom Bochum Audi A3 (Typ: 8P), 1.9TDi, 2.0TDi, beleértve DSG, kivéve Quattro, 2003-2012-ig, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a3-typ-8p-1-9tdi-2-0tdi-beleertve-dsg-kiveve-quattro-2003-2012-ig-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(55, '', 'Az Audi A3 Sportback Quattro rendelkezik állítható magasságú sport futóművel, mely 2003-tól elérhető. A futómű beszereléséhez szükséges a rövidített stabilizátor rúd (kutyacsont), mely nem része a szettnek. Az autó tengelyterhelése elöl 1200 kg, hátul pedig 1250 kg. Ez a futómű Németországban készült, és 2 év teljeskörű garanciát biztosít. A szett tartalmaz 4 lengéscsillapítót rugókkal, valamint 1 állítókulcsot. A termék rendkívül kedvező áron érhető el, kiemelkedő minőséget garantálva. A futómű rendelkezik TÜV engedéllyel, melyről további információk az alábbi linken találhatók: [TÜV engedély](https://www.jom.de/media/files_public/716b59ea817a524fbb3ab0042fedfe8f/741041_741036%20update%202.pdf).', 'Jom Bochum Audi A3 (Typ: 8P) Sportback Quattro, 2.0TFSi, 2.0TDi, 2.0TDi DSG, 3.2, 2003-2012-ig, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a3-typ-8p-sportback-quattro-2-0tfsi-2-0tdi-2-0tdi-dsg-3-2-2003-2012-ig-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(56, '', '<div>\\nAz Audi A3 (8P típus) autóhoz kifejlesztett V-Maxx állítható magasságú sport futómű egy lehetőséget nyújtó rendszer, amely lehetővé teszi a futómű magasságának szabályozását.\\n</div>', 'V-Maxx Audi A3 (Typ: 8P), 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve Sportback és Quattro, 2003-2012.09-ig, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8p-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-sportback-es-quattro-2003-2012-09-ig-50mm-szaratmer-allithato-magassagu-futomu'),
(57, '', '<div>\\n  <div>\\n    A V-Maxx állítható magasságú sport futómű egy olyan kiegészítő, amelyet az Audi A3 (Typ: 8P) modellhez terveztek.\\n  </div>\\n</div>', 'V-Maxx Audi A3 (Typ: 8P), 1.2TFSi, 1.4TFSi, 1.6, 1.8TFSi, 2.0, 2.0TFSi DSG, 1.9TDi, kivéve Sportback és Quattro, 2003-2012.09-ig, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8p-1-2tfsi-1-4tfsi-1-6-1-8tfsi-2-0-2-0tfsi-dsg-1-9tdi-kiveve-sportback-es-quattro-2003-2012-09-ig-50mm-szaratmer-allithato-magassagu-futomu'),
(58, '', '</div>\\n<div>\\n<p>Ez a futómű speciálisan az Audi A3 (8P típus) modellekhez lett kialakítva, hogy egyedi és sportos megjelenést kölcsönözzön. A magassága állítható, így lehetőség van a jármű alacsonyabbra vagy magasabbra emelésére az egyéni igények szerint.</p>\\n</div>', 'V-Maxx Audi A3 (Typ: 8P), 1.2TFSi, 1.4TFSi, 1.6, 1.8TFSi, 2.0, 2.0TFSi DSG, 1.9TDi, kivéve Sportback és Quattro, 2003-2012.09-ig, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8p-1-2tfsi-1-4tfsi-1-6-1-8tfsi-2-0-2-0tfsi-dsg-1-9tdi-kiveve-sportback-es-quattro-2003-2012-09-ig-55mm-szaratmer-allithato-magassagu-futomu'),
(59, '', '<div>\\nAz Audi A3 (Typ: 8P) V-Maxx sport felfüggesztése állítható magassággal rendelkezik\\n</div>', 'V-Maxx Audi A3 (Typ: 8P), 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve Sportback és Quattro, 2003-2012.09-ig, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-audi-a3-typ-8p-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-sportback-es-quattro-2003-2012-09-ig-55mm-szaratmer-allithato-magassagu-futomu'),
(60, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az elérhető árakat. A futóművek fokozatmentesen állíthatók, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság széles tartományban, általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu'),
(61, '', '<p>Az MTS-Technik által készített állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az elérhető ár-érték arányt. A futóművek könnyedén állíthatók a legmegfelelőbb magasságra a különböző útviszonyoknak köszönhetően. Az MTS-Technik futóművek kiváló összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasságot általában 25 és 80 mm között lehet szabadon állítani</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Kettős bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Optimális egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen beszerelhető, nem igényel módosításokat az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, (első tengely terhelés 1036-1170kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-els-tengely-terheles-1036-1170kg-street-series-allithato-magassagu-futomu'),
(62, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumokat kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport futóművek optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p>Az alábbi típusokhoz ajánlott:</p>\n<ul>\n    <li>Audi A3 (Typ: 8P)</li>\n    <li>Audi A3 Sportback (Typ: 8P)</li>\n    <li>Audi A3 Cabrio (Typ: 8P)</li>\n    <li>Első tengely terhelés: 1036-1170kg</li>\n    <li>Hátsó tengely terhelés: 1150kg</li>\n    <li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n    <li>Ültetés mértéke elöl: 35-70mm</li>\n    <li>Ültetés mértéke hátul: 35-60mm</li>\n    <li>TÜV engedéllyel rendelkezik</li>\n    <li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n    <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n    <li>speciális Eibach rugók a maximális sportosság érdekében</li>\n    <li>a Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n    <li>gáztöltéses lengéscsillapítók</li>\n    <li>magas hatékonyság extrém igénybevétel mellett is</li>\n    <li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n    <li>tökéletes összhang rugó és lengéscsillapító között</li>\n    <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, (első tengely terhelés 1036-1170kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-els-tengely-terheles-1036-1170kg-sport-series-allithato-magassagu-futomu'),
(63, '', '<strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p>A <strong>MTS-Technik Sport sorozatú állítható magasságú sport futómű</strong> ideális választás azoknak, akik nem kívánnak kompromisszumot kötni! Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága az <strong>MTS-Technik Sport állítható futóműveivel</strong>. Az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> optimális együttműködése maximális vezetési élményt biztosít, széles ültetési tartománnyal!</p>  <p>A következő típusokhoz:</p>  <ul> 	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1035kg alatt</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elől: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li> 	<li>gáztöltetű lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p> ', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(64, '', '<div><span>Az Ap futómű olyan lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy precízen beállíthassák az általuk kívánt üléspozíciót. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kínáljuk a maximális üléspozícióval összekapcsolva.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetséges a jármű magasságának egyénileg történő beállítása a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</span></div> <ul>     <li><span>kiváló minőség elérhető áron</span></li>     <li><span>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány<br type=\\\"_moz\\\" />     </span></li>     <li><span>különleges ár/érték arány<br type=\\\"_moz\\\" />     </span></li>     <li><span>német minőség</span></li> </ul>', 'AP made by KW Audi A3 Cabrio (Typ: 8P), 2008.04-től, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-cabrio-typ-8p-2008-04-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(65, '', '<div><span>Az Ap futómû lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be a kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk, maximális ültetéssel összekötve.</span></div> <div><span>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság párhuzamos összehangolása optimális felépítést eredményez.</span></div> <ul>     <li><span>Kiemelkedő minőség megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár/érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Audi A3 (Typ: 8P) Quattro, beleértve Sportback, 2003.09-től, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8p-quattro-beleertve-sportback-2003-09-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(66, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy milliméterre precízen beállítsák a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div> <div>A járműmagasság beállítására alumínium rugótányér áll rendelkezésre, mely lehetővé teszi az egyéni beállítást a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus összehangolása optimális felhasználói élményt nyújt.</div> <ul> <li>kiváló minőségű termék megfizethető áron</li> <li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány biztosított</li> <li>kiemelkedő ár-érték arány</li> <li>német minőség és megbízhatóság</li> </ul>', 'AP made by KW Audi S3 (Typ: 8P), 2007.01-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-s3-typ-8p-2007-01-tol-allithato-magassagu-futomu'),
(67, '', '<div>Az Ap futómű kifejezetten azoknak a vezetőknek lett tervezve, akik szeretik sportosan vezetni autójukat. A futómű lehetővé teszi, hogy a felhasználó milliméter pontosan állítsa be az ülésmagasságot, így kombinálva a sportos irányíthatóságot és az optimális vezetési élményt a maximális ültetéssel.</div>  <div>Egy alumínium rugótányér segítségével könnyen beállítható a jármű magassága a TÜV által engedélyezett tartományban. Ennek eredményeként a futómű optimális felépítést biztosít, amely ötvözi a sportosságot, a kényelmet és a biztonságot.</div>  <ul> 	<li>kiváló minőségű termék megfizethető áron</li> 	<li>egyedi magasságbeállítási lehetőség a TÜV által engedélyezett tartományban</li> 	<li>magas minőségű alkatrészek és TÜV tanúsítvány biztosítja a megbízhatóságot</li> 	<li>kivételes ár/érték arány</li> 	<li>német minőség és megbízhatóság</li> </ul>', 'AP made by KW Audi A3 Cabrio (Typ: 8P), 2008.04-től, (első tengely terhelés 1106-1170kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-cabrio-typ-8p-2008-04-tol-els-tengely-terheles-1106-1170kg-allithato-magassagu-futomu'),
(68, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy a kívánt ültetést milliméterre pontosan beállítsák. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözésével maximális ültetést kínálunk.</div>  <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyát biztosítjuk, így optimális felépítést garantálva.</div>  <ul> 	<li>kiváló minőség megfizethető áron</li> 	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>egyedülálló ár/érték arány</li> 	<li>német minőség</li> </ul>', 'AP made by KW Audi A3 (Typ: 8P) Quattro, beleértve Sportback, 2003.09-től, (első tengely terhelés 1106-1170kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8p-quattro-beleertve-sportback-2003-09-tol-els-tengely-terheles-1106-1170kg-allithato-magassagu-futomu'),
(69, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy a kívánt ültetést milliméterre pontosan beállíthassa. Az optimális vezetési magatartás és a sportos irányíthatóság kombinációját nyújtjuk a maximális ültetéssel összekapcsolva.</div> <div>A járműmagasságot egy alumínium rugótányér segítségével egyénileg beállíthatja a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot párhuzamosan összehangolva optimális felépítést biztosítunk.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(70, '', '<div>Az Ap futómű rendszer lehetőséget kínál a sportosan ambiciózus vezetőknek arra, hogy milliméterre precízen állítsák be az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk, amelyet a maximális ültetéssel összekapcsolunk.</div>  <div>Egy alumínium rugótányér segítségével a járműmagasságot a TÜV által jóváhagyott tartományban lehet egyénileg beállítani. A sportosság, kényelem és biztonság harmonikus egyensúlyát biztosító optimális felépítést garantáljuk.</div>  <ul> 	<li>kiváló minőség megfizethető áron</li> 	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>páratlan ár/érték arány</li> 	<li>német minőség</li> </ul>  ', 'AP made by KW Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(71, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû a következõ autótípusba passzol:</p>  <ul> 	<li>Audi A3 Limousine, Sportback, Elsõ kerék hajtás, Elsõ lengéscsillapító átmérõ: 55mm</li> 	<li>Tipuskód: 8P</li> 	<li>Kivéve: Quattro</li> 	<li>Évjárat: 2003.03-tól</li> 	<li>Tengelyterhelés elöl (kg): 1170</li> 	<li>Tengelyterhelés hátul (kg): 1005</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!<br /> 	Csak 55mm átmérõjû elsõ lengéscsillapitó-szár átmérõjû modellekhez.<br /> 	Magnetride elektromágneses futómûvel ellátott Audi modelleknél a vezérlõegység deakitválása szükséges !</li> </ul>  <ul> 	<li>Ez az futómûszett Német nyelvû TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetõség elöl: +10 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Made In Ap-Fahrwerke Németország</li> 	<li>Garancia erre a termékre: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-040</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div>  <div>Az AP futómû lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy egyéni ültetést végezzenek járművükön. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</div>  <div>Egy alumínium rugótányér segítségével lehetséges a jármű magasságának egyéni beállítása a TÜV által jóváhagyott tartományon belül. A sportosság, kényelem és biztonság összehangolása a legjobb felépítést eredményezi.</div>  <ul> 	<li>kiváló minőség megfizethető áron</li> 	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>egyedülálló ár/érték arány</li> 	<li>német minőség</li> </ul>  ', 'AP made by KW Audi A3 (Typ: 8P), beleértve Sportback, 2003.05-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8p-beleertve-sportback-2003-05-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(72, '', '<p><strong>Vogtland</strong><span> futómű készlet</span>: AUDI A3</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2007.01-től</li>\n    <li><strong>Ültetés mértéke</strong>: 10 - 40 / 10 - 40 mm</li>\n    <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve S3, a lengéscsillapító ház átmérője 55 mm, elektronikus lengéscsillapító nélkül</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 1170 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű maximális vezetési élményt nyújt. Az ültetés mértékét saját elképzelése szerint állíthatja be a megfelelő értékek között. Ez a kiváló minőségű futómű készlet speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A készlet alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968305</p>', 'Vogtland Audi S3 (Typ: 8P), kivéve elektronikus futómű szabályzás, 2007.01-től állítható magasságú futómű', '', '', '', 'vogtland-audi-s3-typ-8p-kiveve-elektronikus-futomu-szabalyzas-2007-01-tol-allithato-magassagu-futomu'),
(73, '', '<p><strong>Vogtland</strong><span> futómű szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>:2003.01-től</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 mm</li>     <li><strong>Típus</strong>: Az Audi A3, Typ 8P, beleértve a Sportbackot, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése legfeljebb 1060 kg, kivéve az elektronikus lengéscsillapítót és a 4WD-t</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett maximalizálja a vezetési élményt. Az ültetés mértékét az egyéni igények szerint állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyekhez szintező vagy torziós futóművet szereltek.</p> <p>Made in Germany!</p> <p>Cikkszám: 968231</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, kivéve elektronikus futómű szabályzás, 2003.05-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-kiveve-elektronikus-futomu-szabalyzas-2003-05-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(74, '', '<p><strong>Vogtland</strong><span> által készített állítható magasságú futómű szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>:2003.09-től</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, Quattro, beleértve Sportback, beleértve Cabrio, az első tengely terhelése több mint 1105 kg, kivéve elektronikus lengéscsillapító</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1105 kg) 1170 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li> </ul> <p>Az autó megjelenésén javítva maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igényeknek megfelelően lehet beállítani. A futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A 100 éves tapasztalattal rendelkező gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autók esetében.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968304</p>', 'Vogtland Audi A3 (Typ: 8P) Quattro, beleértve Sportback és Cabrio, kivéve elektronikus futómű szabályzás, 2003.09-től, (első tengely terhelés 1105kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-quattro-beleertve-sportback-es-cabrio-kiveve-elektronikus-futomu-szabalyzas-2003-09-tol-els-tengely-terheles-1105kg-folott-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(75, '', '<p><strong>Vogtland</strong><span> áltítható magasságú futómű szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>: 2003.01-től</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, a lengéscsillapító ház átmérője 50 mm, az első tengely terhelése legfeljebb 1060 kg, kivéve elektronikus lengéscsillapító és 4WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt biztosít. Az ültetés mértékét a saját elképzelése szerint állíthatja be. A futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát nyújtanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968230</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, kivéve elektronikus futómű szabályzás, 2003.05-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-kiveve-elektronikus-futomu-szabalyzas-2003-05-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(76, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A3</p>\n<ul>\n    <li><strong>Évjárat</strong>: Az 2003.01-től</li>\n    <li><strong>Ültetés mértéke</strong>: A széles skálán belül lehet állítani, hogy az autó mennyire legyen közel a talajhoz.</li>\n    <li><strong>Típus</strong>: Az Audi A3, Typ 8P, beleértve a Sportback változatot is. Az első tengely terhelése meghaladja az 1060 kg-ot, kivéve az elektronikus lengéscsillapítót és a négykerékhajtást.</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1060 kg) Az 1170 kg-ot haladja meg.</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: Az 1150 kg-ot nem haladja meg.</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett ez a futómű szett optimális vezetési élményt kínál. Az ültetés mértékét személyes igényei szerint állíthatja be. Ez a minőségi futómű szett kizárólag kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugókészítés területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintező- vagy torziós futóművet szereltek fel.</p>\n<p>Németországban készült!</p>\n<p>Cikkszám: 968232</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, kivéve elektronikus futómű szabályzás, 2003.05-től, 50mm szárátmérő, (első tengely terhelés 1060kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-kiveve-elektronikus-futomu-szabalyzas-2003-05-tol-50mm-szaratmer-els-tengely-terheles-1060kg-folott-allithato-magassagu-futomu'),
(77, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: AUDI A3</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2003.01-től</li>\n    <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>\n    <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, a lengéscsillapító ház átmérő 55 mm, az első tengely terhelése több mint 1060 kg, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>\n    <li><strong>Max. tengelyterhelés elől</strong>: (több mint 1060 kg) 1170 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a termék optimális vezetési élményt nyújt. Az ültetés mértékét személyes igényei szerint állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint száz éve van jelen a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra!</p>\n<p>A szett általában 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968233</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, kivéve elektronikus futómű szabályzás, 2003.05-től, 55mm szárátmérő, (első tengely terhelés 1060kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-kiveve-elektronikus-futomu-szabalyzas-2003-05-tol-55mm-szaratmer-els-tengely-terheles-1060kg-folott-allithato-magassagu-futomu'),
(78, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>: 2003.09-tõl</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, Quattro, beleértve Sportback, beleértve Cabrio, az elsõ tengely terhelése legfeljebb 1105 kg, kivéve elektronikus lengéscsillapító</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1105 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1160 kg</li> </ul> <p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. A szett lehetővé teszi az ültetés mértékének testreszabását az egyéni igények szerint. A futómű speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek a kiegyensúlyozott komfort és fokozott dinamika érdekében alacsony nyomású gázrendszerrel rendelkeznek. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó kiváló teljesítményéhez.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel rendelkező autótípusok esetén.</p> <p>Készült Németországban!</p> <p>Cikkszám: 968303</p>', 'Vogtland Audi A3 (Typ: 8P) Quattro, beleértve Sportback és Cabrio, kivéve elektronikus futómű szabályzás, 2003.09-től, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-quattro-beleertve-sportback-es-cabrio-kiveve-elektronikus-futomu-szabalyzas-2003-09-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(79, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: AUDI A3</span></div>\n<ul>\n<li><strong>Évjárat</strong>: 2007.01-tõl</li>\n<li><strong>Ültetés mértéke</strong>: 10 - 40 / 10 - 40 mm</li>\n<li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve S3, a lengéscsillapító ház átmérõ 55 mm, DDC futómûvel szerelt típusokhoz <strong>(DDC kiiktatása szükséges, a DDC deaktiváló szettet a csomag tartalmazza!)</strong></li>\n<li><strong>Max. tengelyterhelés elõl</strong>: 1170 kg</li>\n<li><strong>Max. tengelyterhelés hátu</strong>l: 1160 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. A futóművet könnyedén beállíthatja az Ön igényei szerint, és a kiváló minőségű kétcsöves lengéscsillapítók biztosítják a kiegyensúlyozott komfortot és dinamikát alacsony nyomású gázrendszerüknek köszönhetően. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968294</p>', 'Vogtland Audi S3 (Typ: 8P), csak elektronikus futómű szabályzással ellátott típusokhoz, 2007.01-től állítható magasságú futómű', '', '', '', 'vogtland-audi-s3-typ-8p-csak-elektronikus-futomu-szabalyzassal-ellatott-tipusokhoz-2007-01-tol-allithato-magassagu-futomu'),
(80, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: AUDI A3</span></div> <ul>     <li><strong>Évjárat</strong>:2003.07-től</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, az első tengely terhelése legfeljebb 1060 kg, a lengéscsillapító ház átmérő 50 mm, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. Az ültetés mértékét az egyén saját elképzelése alapján állíthatja be a megfelelő értékeken belül. Az innovatív futómű szett kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott kényelmet és a fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Németországban készült!</p> <p>Cikkszám: 968297</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, csak elektronikus futómű szabályzással ellátott típusokhoz, 2003.05-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-csak-elektronikus-futomu-szabalyzassal-ellatott-tipusokhoz-2003-05-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(81, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: AUDI A3</span></div> <ul>     <li><strong>Évjárat</strong>: 2003.05-tõl</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>     <li><strong>Típus</strong>: Az Audi A3 Vogtland állítható magasságú futómű szettje ideális választás a 2003.05-től gyártott típushoz. Kompatibilis az Audi A3 Typ 8P modellekkel, beleértve a Sportback verziót is. A futómű terhelésének maximális első tengelye 1060 kg-ig terjed, míg a lengéscsillapító ház átmérője 55 mm. Az elektronikus lengéscsillapítóval felszerelt változat kivételével 4WD modellekhez is használható.</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li> </ul> <p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is fokozza. A szett lehetőséget biztosít az ültetés mértékének szabályozására, így a felhasználó saját elképzeléseinek megfelelően állíthatja be. A kiváló minőségű futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és dinamikus vezetési élményt nyújtanak. Az elsőosztályú korrózióvédelemmel ellátott lengéscsillapítók hosszú távú megbízhatóságot biztosítanak.</p> <p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, így garantáltan megfelel a szigorú minőségi előírásoknak. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugókészítés területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A szett alapvető tartalma 4 darab ültetőrugó és 4 darab lengéscsillapító, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968298</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, csak elektronikus futómű szabályzással ellátott típusokhoz, 2003.05-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-csak-elektronikus-futomu-szabalyzassal-ellatott-tipusokhoz-2003-05-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(82, '', '<div><strong>Vogtland</strong><span> </span><strong>állítható magasságú futómű szett az AUDI A3-hoz</strong></div>\n<ul>\n	<li><strong>Gyártási év</strong>: 2003.05-től</li>\n	<li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>\n	<li><strong>Alkalmazható típus</strong>: Audi A3, Typ 8P, beleértve a Sportbacket is, az első tengely terhelése meghaladja a 1060 kg-ot, a lengéscsillapító ház átmérője 55 mm, DDC futóművel szerelt típusokhoz (DDC kikapcsolása szükséges, a DDC deaktiváló szettet a csomag tartalmazza!)</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1060 kg) 1170 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li>\n</ul>\n<p>Az autó megjelenésén javítva, ez a futómű szett optimális vezetési élményt nyújt. Az ültetés mértékét szabadon beállíthatja az egyéni igényei szerint. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott kényelmet és fokozott dinamikát. Az első osztályú korrózióállóságú lengéscsillapítók biztosítják a tartósságot.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968293</p>', 'Vogtland Audi A3 (Typ: 8P), beleértve Sportback, csak elektronikus futómű szabályzással ellátott típusokhoz, kivéve Quattro, 2003.05-től, 55mm szárátmérő, (első tengely terhelés 1060kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-beleertve-sportback-csak-elektronikus-futomu-szabalyzassal-ellatott-tipusokhoz-kiveve-quattro-2003-05-tol-55mm-szaratmer-els-tengely-terheles-1060kg-fo