(84, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: AUDI A3</span></div>  <ul> 	<li><strong>Évjárat</strong>: 2003.09-tõl</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Az Audi A3, Typ 8P, Quattro, beleértve Sportback és Cabrio modelleket is magában foglalja. Az első tengely terhelése legfeljebb 1105 kg. A DDC futóművel szerelt típusokhoz tartozó DDC deaktiváló szettet a csomag tartalmazza.</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1105 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1160 kg</li> </ul>  <p>A Vogtland állítható magasságú futómű szett nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. A beállítható ültetésnek köszönhetően személyre szabottan állítható az autó magassága. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve az autótípusokat, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968600</p>  ', 'Vogtland Audi A3 (Typ: 8P) Quattro, beleértve Sportback és Cabrio, csak elektronikus futómű szabályzással ellátott típusokhoz, 2003.09-től, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8p-quattro-beleertve-sportback-es-cabrio-csak-elektronikus-futomu-szabalyzassal-ellatott-tipusokhoz-2003-09-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futo'),
(85, '', '<p>Audi A3 Sportback és Limousine JOM BLUE LINE állítható magasságú sport futómű</p>\n<p>Típuskód: 8V</p>\n<p>Évjárat: 2012-től</p>\n<p>Csak Multilink futóművel szerelt típusokhoz!</p>\n<p>Tengelyterhelés elöl: 1080 kg</p>\n<p>Tengelyterhelés hátul: 1060 kg</p>\n<p>MADE IN GERMANY</p>\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>\n<p>Kiváló minőség, hihetetlenül jó áron!!!</p>\n<p>A szett tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</p>\n<p><strong>Jom BlueLine állítható magasságú sportfutómű</strong></p>\n<p> </p>\n<p>A BlueLine állítható magasságú futóművek kiemelkedő minőséget képviselnek, egyedi jellemzőkkel rendelkeznek. Az autó magassága könnyedén módosítható a speciális beállító eszköz segítségével a megadott tartományon belül.</p>\n<p>- 19.3 TÜV minősítéssel büszkélkedhet</p>\n<p>- Az EPS technológiával ellátott alkatrészek porfestéssel vagy horganyzással készültek</p>', 'Jom Bochum Audi A3 (Typ: 8V) Sportback és Limousine, 1.6TDi, 2.0TDi, csak Multilink futóművel szerelt, 2012-től, (első tengely terhelés 1080kg alatt), BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a3-typ-8v-sportback-es-limousine-1-6tdi-2-0tdi-csak-multilink-futomuvel-szerelt-2012-tol-els-tengely-terheles-1080kg-alatt-blueline-allithato-magassagu-futomu'),
(86, '', '<strong>JOM BLUE LINE állítható magasságú sport futómű az Audi A3 Sportback és Limousine modellekhez</strong></p>  <p>Ez a futómű a 8V típuskódú, 2012-től gyártott Audi A3 modellekhez lett tervezve, kivéve azokat, amelyek Multilink futóművel vannak felszerelve.</p>  <p>Az elő tengely terhelése 965 kg, míg a hátsó tengelyé 1060 kg.</p>  <p>A termék \"MADE IN GERMANY\" minőségű, és rendelkezik német nyelvű TÜV engedéllyel, amit a csomagolás tartalmaz.</p>  <p>A futóművet 2 év teljeskörű garanciával kínáljuk, kiváló minőségben, kedvező áron!</p>  <p>A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot az állításhoz.</p>  <p><strong>Jom BlueLine állítható magasságú sportfutómű</strong></p>  <p>A BlueLine futóművek magas színvonalat képviselnek, és mindegyik típusspecifikus. Az autó magassága könnyedén állítható a speciális állítókulcs segítségével az előre meghatározott tartományon belül.</p>  <p>- A futómű rendelkezik 19.3 TÜV minősítéssel</p>  <p>- Az EPS technológiával ellátott alkatrészek porfestéssel és horganyzott felülettel rendelkeznek</p> ', 'Jom Bochum Audi A3 (Typ: 8V), 1.2TFSi, 1.4TFSi, 1.6TDi, 1.8TFSi, 2.0TDi, kivéve Multilink futóművel szerelt, 2012-től, (első tengely terhelés 965kg alatt), BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a3-typ-8v-1-2tfsi-1-4tfsi-1-6tdi-1-8tfsi-2-0tdi-kiveve-multilink-futomuvel-szerelt-2012-tol-els-tengely-terheles-965kg-alatt-blueline-allithato-magassagu-futomu'),
(87, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach vállalat gyártja</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>A rugók és a lengéscsillapítók tökéletes összhangja</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8V), csak MultiLink futóművel szerelt, beleértve Quattro, 2012.04-től, (első tengely terhelés 1081-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8v-csak-multilink-futomuvel-szerelt-beleertve-quattro-2012-04-tol-els-tengely-terheles-1081-1180kg-allithato-magassagu-futomu'),
(88, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz, és könnyedén beállítható az autó hasmagassága is. Az MTS-Technik futóművei egyensúlyban tartják a rugókat és a lengéscsillapítókat.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművekhez az Eibach gyártja a rugókat.</li>\n	<li>Ezek a termékek rendelkeznek TÜV engedéllyel.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók találhatók bennük.</li>\n	<li>Kiemelkedő hatékonyság jellemzi őket extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat védi őket a hosszú távú korróziótól (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>A rugó és lengéscsillapító tökéletes összhangban van egymással.</li>\n	<li>A készlet plug & play, így nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8V), kivéve MultiLink futóművel szerelt, 2012.04-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8v-kiveve-multilink-futomuvel-szerelt-2012-04-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(89, '', '<p>Az MTS-Technik állítható magasságú sport futóművei kiváló választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóműveiben ideális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>A termék rendelkezik TÜV engedéllyel.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszútávú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8V), csak MultiLink futóművel szerelt, beleértve Quattro, 2012.04-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8v-csak-multilink-futomuvel-szerelt-beleertve-quattro-2012-04-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(90, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futómű ideális választás azoknak, akik számára fontos a minőség és az ár közötti egyensúly. A futómű fokozatmentesen állítható magassággal rendelkezik, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlyban vannak.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>A termék TÜV engedéllyel rendelkezik.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém terhelés mellett is.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8V), kivéve MultiLink futóművel szerelt, 2012.04-től, (első tengely terhelés 1081-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8v-kiveve-multilink-futomuvel-szerelt-2012-04-tol-els-tengely-terheles-1081-1180kg-allithato-magassagu-futomu'),
(91, '', '<div><span>Az Ap futómű célja, hogy a sportosan ambiciózus vezetők számára lehetővé tegye a kívánt ültetés milliméteres pontossággal történő beállítását. A sportos irányíthatóság és optimális vezetési tulajdonságok összehangolásával maximalizálja az ültetést.</span></div>\\r\\n\\r\\n<div>A járműmagasság egyedi beállítására egy alumínium rugótányér szolgál, mely lehetővé teszi a TÜV által engedélyezett tartományban történő szabályozást. A sportosság, kényelem és biztonság tökéletes egyensúlyban van ebben az optimális konstrukcióban.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>különleges ár-érték arány</li>\\r\\n	<li>német minőségű kivitelezés</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos! Ezen futómű esetében csak a magasság állítható! A keménység nem módosítható!</div>\\r\\n', 'AP made by KW Audi A3 (Typ: 8V), beleértve Sportback, kivéve Quattro, Multilink futóművel szerelt és elektronikus futómű szabályzással, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-beleertve-sportback-kiveve-quattro-multilink-futomuvel-szerelt-es-elektronikus-futomu-szabalyzassal-2012-08-tol-50mm-szaratmer-els-tengely-terheles-980kg-alatt-al'),
(92, '', '<p>A Vogtland magasságállítható futómű készlet kifejezetten az Audi A3 típushoz lett tervezve, beleértve a Sportback változatot is. Az állítási tartomány 30-60 mm az elülső tengelyen és 30-55 mm a hátsó tengelyen. A futómű tartalmaz nagy teljesítményű kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és dinamikus vezetési élményt nyújtanak alacsony nyomású gázrendszerüknek köszönhetően.</p> \n\n<p>Ezen kívül, a futómű maximális tengelyterhelése elöl 1090 kg, míg hátul 1040 kg. A termék minőségi, elsőosztályú korrózióvédelemmel rendelkezik, és TÜV minősítéssel büszkélkedhet. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugókészítés területén, és 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> \n\n<p>A futómű tartalmazza az 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autóknál, amelyeknél szintező vagy torziós futóművet alkalmaznak. A termék Made in Germany!</p> \n\n<p>Cikkszám: 968774</p>', 'Vogtland Audi A3 (Typ: 8V) Quattro, kivéve elektronikus futómű szabályzás, 2012.05-től, 55mm szárátmérő, (első tengely terhelés 1090kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-quattro-kiveve-elektronikus-futomu-szabalyzas-2012-05-tol-55mm-szaratmer-els-tengely-terheles-1090kg-alatt-allithato-magassagu-futomu'),
(93, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás az Audi A3 típusú autókhoz, melyek gyártási éve 2012-től kezdődnek. Ez a futómű szett lehetővé teszi az ültetés mértékének széles skálán történő beállítását, biztosítva ezzel a maximális vezetési élményt. Fontos tudni, hogy ez a termék csak a 2WD hajtásláncú Audi A3 modellekhez használható, beleértve a Sportback változatot is.</p> <p>A futómű szett kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók korrózióvédelme is kiemelkedő.</p> <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Ez a minőségi termék Made in Germany és cikkszáma: 968773.</p>', 'Vogtland Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 55mm szárátmérő, (első tengely terhelés 981-1075kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-55mm-szaratmer-els-tengely-terheles-981-1075kg-allithato-m'),
(94, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett ideális választás az Audi A3 típusú járművekhez, melyek gyártási éve 2012-től kezdődnek. Ez a futómű lehetővé teszi az autó ültetésének mértékének széles skálájú beállítását, a vezetési élmény maximalizálása érdekében.</p>\n<p>A futómű szett kizárólag az Audi A3 Typ 8V, 2WD modellekhez készült, beleértve a Sportback változatot is. Az első tengely maximális terhelése 980 kg, és csak multi-link hátsó felfüggesztéssel kompatibilis. A lengéscsillapító ház átmérője 55 mm, kivéve az elektronikus lengéscsillapítókat és a 4WD rendszert.</p>\n<p>Ez a minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az elsőosztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugókészítés terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968772</p>', 'Vogtland Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 55mm szárátmérő, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-55mm-szaratmer-els-tengely-terheles-980kg-alatt-allithato-'),
(95, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett célja az Audi A3 típusú autók javítása, beleértve a 2012-től gyártottakat is. Ez a futómű szett lehetővé teszi az ültetés mértékének 30-60 mm közötti és 30-55 mm közötti beállítását az Audi A3 típushoz, beleértve a Sportbacket is, kizárólag a multi-link hátsó felfüggesztéshez. Ennek a kiváló minőségű futómű szettnek a lengéscsillapító ház átmérője 50 mm, és nem tartalmaz elektronikus lengéscsillapítót vagy 4WD-t.</p>\n\n<p>Ezen felül a Vogtland futómű nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetőrugók és a lengéscsillapítók beállítása lehetővé teszi a személyre szabott ültetés mértékét, miközben a kiegyensúlyozott komfortot és fokozott dinamikát biztosítja az alacsony nyomású gázrendszerű lengéscsillapítók révén.</p>\n\n<p>A Vogtland futómű szett kiváló korrózióvédelmet biztosít elsőosztályú kétcsöves lengéscsillapítóinak köszönhetően. A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968701</p>', 'Vogtland Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 981-1075kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-50mm-szaratmer-els-tengely-terheles-981-1075kg-allithato-m'),
(96, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelel az Audi A3 típusú autókhoz, beleértve a Sportbacket is. Ennek a futómű szetnek az érvényességi időtartama 2012-től kezdődik. Az ültetés mértéke 30-60 mm az elülső tengelyen és 30-55 mm a hátsó tengelyen. A futómű kizárólag a 2WD típusú Audi A3 modellekhez használható, multi-link hátsó felfüggesztéssel rendelkező autóknál. Fontos megjegyezni, hogy a lengéscsillapító ház átmérője 50 mm, és nem kompatibilis az elektronikus lengéscsillapítóval vagy a 4WD rendszerrel.</p>\n\n<p>A Vogtland futómű javítja az autó megjelenését és optimális vezetési élményt nyújt. A futómű beállításait az egyéni igények szerint lehet módosítani, hogy maximális komfortot és dinamikát biztosítson. A készlet kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel a kiegyensúlyozott kényelem és a dinamika érdekében. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>Ez a minőségi futómű szett TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968700</p>', 'Vogtland Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-50mm-szaratmer-els-tengely-terheles-980kg-alatt-allithato-'),
(97, '', '<p>Ez a könnyen állítható AP-Fahrwerke futómű megfelel az alábbi Audi A3 típusnak:</p>\n\n<ul>\n	<li>Modellek: Audi A3, 2WD, Multilink hátsó futómű</li>\n	<li>Tipuskód: 8V</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2012.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 980</li>\n	<li>Tengelyterhelés hátul (kg): 975</li>\n	<li>Egyéb információk: Kompatibilis csak elektronikus lengéscsillapító-vezérlés (EDC) nélküli modellekhez. Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez. Elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futómű Németországban gyártott, Német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-55 mm között állítható (A futóműszett ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li>\n	<li>Plusz ültetési lehetőség elöl: +20 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke</li>\n	<li>Garancia: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: GF10-114</strong></p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Audi A3 (Typ: 8V) Quattro, 2013.05-től, 50mm szárátmérő, (első tengely terhelés 1090kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-quattro-2013-05-tol-50mm-szaratmer-els-tengely-terheles-1090kg-alatt-allithato-magassagu-futomu'),
(98, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>Audi A3 Quattro</li>\n	<li>Tipuskód: 8V</li>\n	<li>Beleértve S3</li>\n	<li>Típus variáció: Quattro</li>\n	<li>Évjárat: 2012.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 1090</li>\n	<li>Tengelyterhelés hátul (kg): 1040</li>\n	<li>Egyéb kitételek: Csak olyan modellekhez alkalmas, amelyeknél nincs elektronikus lengéscsillapító-vezérlés (EDC). Csak olyan modellekhez, amelyeknél 55mm átmérőjű első lengéscsillapító-szár van. A gyárilag sportfutóművel rendelkező modelleknél az ültetés mértéke csökkenthető. Az elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedély által meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-55 mm között állítható (természetesen nagyobb intervallumban is lehet állítani a futóművet, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>Plusz ültetés lehetőség elöl: +10 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártva Németországban az Ap-Fahrwerke által</li>\n	<li>2 év garancia ezen termékre</li>\n</ul>\n\n<p><strong>Cikkszáma: GF10-113</strong></p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Audi A3 (Typ: 8V) Quattro, beleértve S3, 2013.05-től, 55mm szárátmérő, (első tengely terhelés 1090kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-quattro-beleertve-s3-2013-05-tol-55mm-szaratmer-els-tengely-terheles-1090kg-alatt-allithato-magassagu-futomu'),
(99, '', '<p>Ez a AP-Fahrwerke Állítható magasságú futómű alkalmas az alábbi autótípusra:</p>\n\n<ul>\n	<li>Audi A3, 2WD, Multilink hátsó futóműves modellek, Első Lengéscsillapító átmérője: 55mm</li>\n	<li>Tipuskód: 8V</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2012.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 1055</li>\n	<li>Tengelyterhelés hátul (kg): 975</li>\n	<li>Egyéb kitételek: Csak elektronikus lengéscsilapító-vezérlés (EDC) nélküli modellekhez.<br />\n	Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.<br />\n	Elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-55 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártva Ap-Fahrwerke Németországban</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszáma: GF10-116</strong></p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 55mm szárátmérő, (első tengely terhelés 981-1055kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-55mm-szaratmer-els-tengely-terheles-981-1055kg-allith'),
(100, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>Audi A3, 2WD, Multilink hátsó futóműves modellek, Első Lengéscsillapító átmérője: 55mm</li>\n	<li>Tipuskód: 8V</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2012.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 980</li>\n	<li>Tengelyterhelés hátul (kg): 975</li>\n	<li>Egyéb kitételek: Csak elektronikus lengéscsilapító-vezérlés (EDC) nélküli modellekhez.<br />\n	Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.<br />\n	Elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-55 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia e termékre: 2 év</li>\n</ul>\n\n<p><strong>Cikkszáma: GF10-114</strong></p>\n\n<p><br />\nAz ár 1 szettre érvényes!</p>', 'AP made by KW Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 55mm szárátmérő, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-55mm-szaratmer-els-tengely-terheles-980kg-alatt-allit'),
(101, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</span></div> <div><span>Egy alumínium rugótányér segítségével egyénileg beállítható a járműmagasság a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot párhuzamosan összehangoljuk az optimális felépítés érdekében.</span></div> <ul>     <li><span>Kiváló minőség elérhető áron</span></li>     <li><span>Egyéni magasság beállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár/érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Figyelem! Csak a magasság állítható ezen futómű esetében, a keménység nem!</span></div>', 'AP made by KW Audi A3 (Typ: 8V), beleértve Sportback, kivéve Quattro, Multilink futóművel szerelt és elektronikus futómű szabályzással, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 981-1055kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-beleertve-sportback-kiveve-quattro-multilink-futomuvel-szerelt-es-elektronikus-futomu-szabalyzassal-2012-08-tol-50mm-szaratmer-els-tengely-terheles-981-1055kg-all'),
(102, '', '<p>Ez a moduláris futóműrendszer kompatibilis az alábbi autótípusokkal:</p>\n\n<ul>\n	<li>Audi A3 2WD modellekhez, melyek Multilink hátsó futóművel rendelkeznek, és a első lengéscsillapító átmérője 50mm.</li>\n	<li>Tipuskód: 8V</li>\n	<li>Típus variáció:</li>\n	<li>Gyártási év: 2012.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 1055</li>\n	<li>Tengelyterhelés hátul (kg): 975</li>\n	<li>Egyéb megjegyzések: Csak olyan modellekhez alkalmas, melyeknél nincs elektronikus lengéscsillapító-vezérlés (EDC). Csak azokhoz az autókhoz, melyeknél a első lengéscsillapító-szár átmérője 50mm. Elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműrendszer rendelkezik német nyelvű TÜV engedéllyel.</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-55 mm között állítható.<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>További ültetési lehetőségek: elöl +20 mm, hátul +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: GF10-107</strong></p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 981-1075kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-50mm-szaratmer-els-tengely-terheles-981-1075kg-allith'),
(103, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>Audi A3, 2WD, Multilink hátsó futóműves modellek, Első Lengéscsillapító átmérője: 50mm</li>\n	<li>Tipuskód: 8V</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2012.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 980</li>\n	<li>Tengelyterhelés hátul (kg): 975</li>\n	<li>Egyéb kitételek: Csak elektronikus lengéscsilapító-vezérlés (EDC) nélküli modellekhez.<br />\n	Csak 50mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.<br />\n	Elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-55 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Made In Ap-Fahrwerke Németországban</li>\n	<li>Garancia a termékre: 2 év</li>\n</ul>\n\n<p><strong>Cikkszáma: GF10-110</strong></p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Audi A3 (Typ: 8V), csak Multilink futóművel, beleértve Sportback, kivéve Quattro és elektronikus futómű szabályzással, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a3-typ-8v-csak-multilink-futomuvel-beleertve-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-2012-08-tol-50mm-szaratmer-els-tengely-terheles-980kg-alatt-allit');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(104, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten az Audi A3 típusú autókhoz lett tervezve, évjáratától függetlenül. A készletben megtalálható az elektronikus futómű szabályzást kiiktató DDC egység is. Ez a speciális futómű szett magas minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók elsőosztályú korrózióvédelemmel rendelkeznek. </p>\n<p>Az ültetés mértéke 30-60 mm-el elöl és 30-55 mm-el hátul állítható. A készlet tartalmazza az engedélyt is, melyet a <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW101GF10-07-14-16_1188-14.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW101GF10-07-14-16_1188-14.pdf</a> linken érhet el. A maximális tengelyterhelés elöl 980 kg, míg hátul 975 kg.</p>\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, de maximális vezetési élményt is nyújt. A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. Alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz a szett, kivéve azoknál az autóknál, amelyeknél szintezős vagy torziós futómű található. </p>\n<p>A Vogtland futóművei Németországban készülnek, és a cikkszámuk: 968160.</p>', 'Vogtland Audi A3 (Typ: 8V), csak Multilink futóművel és elektronikus futómű szabályzással, beleértve Sportback, kivéve Quattro, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-csak-multilink-futomuvel-es-elektronikus-futomu-szabalyzassal-beleertve-sportback-kiveve-quattro-2012-08-tol-50mm-szaratmer-els-tengely-terheles-980kg-alatt-allithato-'),
(105, '', '<p>A Vogtland által készített állítható magasságú futómű szett megfelel az Audi A3 típusú autókhoz, 2012-től. A futómű kitűnő vezetési élményt biztosít, lehetőséget adva az ültetés mértékének személyre szabására. A készlet tartalmazza az elektronikus futómű szabályzást kiiktató DDC egységet. Ez a minőségi futómű szett kizárólag multi-link hátsó felfüggesztésű Audi A3 típusokhoz használható, kizárólag elektronikus lengéscsillapító szabályzással, 2WD hajtással és a lengéscsillapító ház átmérője 50 mm. A maximális tengelyterhelés elöl 981 - 1075 kg, míg hátul 975 kg lehet.</p>  \n<p>Az ültető rugók és lengéscsillapítók kiváló korrózióvédelmet biztosítanak az alacsony nyomású gázrendszernek köszönhetően, ami egyensúlyt teremt a komfort és a dinamika között. A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal a rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  \n<p>Made in Germany!</p>  \n<p>Cikkszám: 968161</p>', 'Vogtland Audi A3 (Typ: 8V), csak Multilink futóművel és elektronikus futómű szabályzással, beleértve Sportback, kivéve Quattro, 2012.08-tól, 50mm szárátmérő, (első tengely terhelés 981-1075kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a3-typ-8v-csak-multilink-futomuvel-es-elektronikus-futomu-szabalyzassal-beleertve-sportback-kiveve-quattro-2012-08-tol-50mm-szaratmer-els-tengely-terheles-981-1075kg-allithato-m'),
(106, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveit úgy tervezték, hogy optimális egyensúlyt teremtsenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>A magasságot általában 25 és 80 mm között lehet beállítani</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Extrém igénybevételre tervezve is magas hatékonyság</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Rugók és lengéscsillapítók tökéletes együttműködése</li>\n	<li>A készlet könnyen beszerelhető, módosításokra nincs szükség a jármű felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8Y) Limousine és Sportback, csak Multilink futóművel szerelt, 2020.03-tól, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8y-limousine-es-sportback-csak-multilink-futomuvel-szerelt-2020-03-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(107, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást jelentenek azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A fokozatmentesen állítható magasságnak köszönhetően könnyedén lehet igazítani az autó hasmagasságát az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális összhang van a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach cég gyártja</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszútávú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8Y) Limousine és Sportback, csak Multilink futóművel szerelt, 2020.03-tól, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8y-limousine-es-sportback-csak-multilink-futomuvel-szerelt-2020-03-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(108, '', '<p>Az MTS-Technik által készített sport futóművek ideális választás azoknak, akik fontosnak tartják a kiváló minőséget és a versenyképes árat! A futómű magassága fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A termék TÜV engedéllyel rendelkezik</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém igénybevételek során is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Rugók és lengéscsillapítók tökéletes együttműködése</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8Y) Limousine és Sportback, kivéve Multilink futóművel szerelt, 2020.03-tól, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8y-limousine-es-sportback-kiveve-multilink-futomuvel-szerelt-2020-03-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(109, '', '<p>Az MTS-Technik által kifejlesztett sport futóművek rugóit az Eibach gyártja, és TÜV engedéllyel rendelkeznek. A magasság fokozatmentesen állítható, általában 25 és 80 mm között. Gáztöltésű lengéscsillapítókkal rendelkeznek, amelyek magas hatékonyságot biztosítanak extrém igénybevételek esetén is. A futóművek két rétegű bevonattal vannak ellátva a hosszan tartó korrózióvédelem érdekében. A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében. Az MTS-Technik állítható futóművei ideális választásnak bizonyulnak azoknak, akik kiemelkedő minőséget keresnek megfizethető áron. Az állítható magasság lehetővé teszi az autó talajtól való magasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>', 'MTS-Technik by Nord Performance Audi A3 (Typ: 8Y) Limousine és Sportback, kivéve Multilink futóművel szerelt, 2020.03-tól, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a3-typ-8y-limousine-es-sportback-kiveve-multilink-futomuvel-szerelt-2020-03-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(110, '', '<strong>VW Passat B8 Bilstein B14 állítható magasságú futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>VW Passat B8</strong> különböző motorváltozatokkal</li>\\r\\n	<li><strong>VW Passat B8 Variant</strong> különböző motorváltozatokkal</li>\\r\\n	<li>Nem kompatibilis DCC futóművel</li>\\r\\n	<li>Csak Multilink futóművel rendelkező járművekhez</li>\\r\\n	<li>55 mm átmérőjű rugótányér</li>\\r\\n	<li>Első tengely teherbírás: 1200 kg alatt</li>\\r\\n	<li>Hátsó tengely teherbírás: 1253 kg alatt</li>\\r\\n</ul>\\r\\n\\r\\n<p><br />\\r\\nBILSTEIN egy csőből álló rendszer<br />\\r\\nFordított technológiával készült<br />\\r\\nErős versenysport rugók<br />\\r\\nÁllítható magasságú (alumíniumból készült rugótányér és kontra anya)<br />\\r\\nA B14-gyel a BILSTEIN mérnökei az utcára szánt versenysport technológiát hozták el, amely lehetővé teszi a jármű magasságának csökkentését akár 50 mm-rel az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelésre tervezett B14 egy csőből álló, fordított technológiája biztosítja a kiegyensúlyozott menetteljesítményt és vezetési élményt minden helyzetben.</p>\\r\\n', 'Bilstein Audi A3 (Typ: 8Y) Limousine és Sportback, csak Multilink futóművel szerelt, 2019.11-től, 55mm szárátmérő, (első tengely terhelés 1200kg alatt), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a3-typ-8y-limousine-es-sportback-csak-multilink-futomuvel-szerelt-2019-11-tol-55mm-szaratmer-els-tengely-terheles-1200kg-alatt-bilstein-b14-allithato-magassagu-futomu'),
(111, '', '<strong>MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azoknak, akik számára fontos a minőség és az ár. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság állítható 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésében</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5) Quattro, beleértve S4, 1994.11-2001.09-ig, (első tengely terhelés 1081-1150kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-quattro-beleertve-s4-1994-11-2001-09-ig-els-tengely-terheles-1081-1150kg-street-series-allithato-magassagu-futomu'),
(112, '', '<p>A MTS-Technik Street állítható magasságú sport futóművek kiváló választás azok számára, akik fontosnak tartják a kiváló minőséget és a versenyképes árat. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben az optimális egyensúlyt a rugók és a lengéscsillapítók között biztosítják.</p><u>Termékjellemzők:</u><ul><li>A futóművek rugóit az Eibach gyártja.</li><li>A magasság szabadon állítható általában 25 és 80 mm között.</li><li>Gáztöltéses lengéscsillapítók.</li><li>Magas hatékonyság extrém igénybevétel mellett is.</li><li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodyzált alumínium alkatrészek).</li><li>Tökéletes összhang rugó és lengéscsillapító között.</li><li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li></ul><u>Termék karakterisztika:</u><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" />', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5) Quattro, beleértve S4, 1994.11-2001.09-ig, (első tengely terhelés 1080kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-quattro-beleertve-s4-1994-11-2001-09-ig-els-tengely-terheles-1080kg-alatt-street-series-allithato-magassagu-futomu'),
(113, '', '<strong>MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Comfort sorozatú állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz! Az <strong>MTS-Technik Comfort állítható futómű</strong> optimális egyensúlyt teremt az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között. </p>  <p><u>A következő típusokhoz ajánlott:</u></p>  <ul> 	<li><strong>Audi A4 Sedan:</strong> 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li> 	<li><strong>Audi A4 Avant:</strong> 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li> 	<li>Elülső ültetés: 40-90mm</li> 	<li>Hátsó ültetés: 45-100mm</li> 	<li>Elülső tengely terhelés: 1081-1150kg</li> 	<li>Hátsó tengely terhelés: 1185kg</li> 	<li>Kivéve Quattro modellek</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>A <strong>Comfort sorozat</strong> létrehozásakor nem a extrém ültetés, hanem a <strong>magas kényelem</strong> volt a fókuszban</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5), kivéve Quattro, 1994.11-2001-ig, (első tengely terhelés 1081-1150kg), Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-kiveve-quattro-1994-11-2001-ig-els-tengely-terheles-1081-1150kg-comfort-series-allithato-magassagu-futomu'),
(114, '', '<p>Az MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik számára fontos a sportos megjelenés mellett az utazási kényelem. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodhasson az útviszonyokhoz. Az MTS-Technik Comfort futóművei az Eibach rugókkal és MTS-Technik lengéscsillapítókkal optimális egyensúlyt biztosítanak.</p>\n\n<u>A következő típusokhoz illeszkedik:</u>\n<ul>\n	<li>Audi A4 Sedan: 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li>\n	<li>Audi A4 Avant: 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li>\n	<li>Ültetés mértéke elöl: 40-90mm</li>\n	<li>Ültetés mértéke hátul: 45-100mm</li>\n	<li>Első tengely terhelés: 1080kg</li>\n	<li>Hátsó tengely terhelés: 1185kg</li>\n	<li>Kivéve Quattro</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort sorozat kialakításakor a hangsúly a magas kényelemre helyeződött</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék karakterisztika:</strong></u>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5), kivéve Quattro, 1994.11-2001-ig, (első tengely terhelés 1080kg alatt), Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-kiveve-quattro-1994-11-2001-ig-els-tengely-terheles-1080kg-alatt-comfort-series-allithato-magassagu-futomu'),
(115, '', '<p>Az MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! A fokozatmentesen állítható magasságnak köszönhetően könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik Comfort futóművei tökéletes egyensúlyban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p> <p><u>A következő típusokhoz passzol:</u></p> <ul> <li>Audi A4 Sedan, 1.8 Quattro / 1.8T Quattro / 2.4 Quattro / 2.6 Quattro / S4 Quattro / 2.8 Quattro / 1.9TDI Quattro / 2.5TDI Quattro</li> <li>Audi A4 Avant, 1.8 Quattro / 1.8T Quattro / 2.4 Quattro / 2.6 Quattro / S4 Quattro / 2.8 Quattro / 1.9TDI Quattro / 2.5TDI Quattro</li> <li>ültetés mértéke elöl: 40-90mm</li> <li>ültetés mértéke hátul: 20-80mm</li> <li>első tengely terhelés: 1080kg</li> <li>hátsó tengely terhelés: 1130kg</li> <li>Kivéve RS4</li> </ul> <p><u>Termékjellemzők:</u></p> <ul> <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li> <li>speciális Eibach rugók a maximális kényelem érdekében</li> <li>a Comfort sorozat létrehozása során nem az extrém ültetésre, hanem a magas kényelemre helyeződött a hangsúly</li> <li>gáztöltéses lengéscsillapítók</li> <li>magas hatékonyság extrém igénybevétel mellett is</li> <li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> <li>tökéletes összhang rugó és lengéscsillapító között</li> <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><u><strong>Termék jellemzői:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5) Quattro, beleértve S4, 1994.11-2001.09-ig, (első tengely terhelés 1080kg alatt), Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-quattro-beleertve-s4-1994-11-2001-09-ig-els-tengely-terheles-1080kg-alatt-comfort-series-allithato-magassagu-futomu'),
(116, '', '<p>Az MTS-Technik Sport sorozat állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A futóművek fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművek optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva a maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<u>A következő típusokhoz illeszkedik:</u>\n<ul>\n	<li>Audi A4 Sedan: 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li>\n	<li>Audi A4 Avant: 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li>\n	<li>Ültetés mértéke elöl: 40-90mm</li>\n	<li>Ültetés mértéke hátul: 45-100mm</li>\n	<li>Elülső tengely terhelés: 1080kg</li>\n	<li>Hátsó tengely terhelés: 1185kg</li>\n	<li>Kivéve Quattro</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék karakterisztika:</strong></u>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5), kivéve Quattro, 1994.11-2001-ig, (első tengely terhelés 1080kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-kiveve-quattro-1994-11-2001-ig-els-tengely-terheles-1080kg-alatt-sport-series-allithato-magassagu-futomu'),
