(118, '', '<p>Az MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik számára fontos a sportos megjelenés mellett az utazási kényelem is! A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodjunk az útviszonyokhoz és beállítsuk az autó hasmagasságát! Az MTS-Technik Comfort állítható futóművei optimális egyensúlyban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p>\n\n<u>A következő típusokhoz kompatibilis:</u>\n<ul>\n	<li>Audi A4 Sedan: 1.8 Quattro, 1.8T Quattro, 2.4 Quattro, 2.6 Quattro, S4 Quattro, 2.8 Quattro, 1.9TDI Quattro, 2.5TDI Quattro</li>\n	<li>Audi A4 Avant: 1.8 Quattro, 1.8T Quattro, 2.4 Quattro, 2.6 Quattro, S4 Quattro, 2.8 Quattro, 1.9TDI Quattro, 2.5TDI Quattro</li>\n	<li>Ültetés mértéke elöl: 40-90mm</li>\n	<li>Ültetés mértéke hátul: 20-80mm</li>\n	<li>Első tengely terhelés: 1081-1150kg</li>\n	<li>Hátsó tengely terhelés: 1130kg</li>\n	<li>Kivéve RS4</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort sorozat kialakításakor nem az extrém ültetés volt a fókuszban, hanem a magas kényelem</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<u><strong>Termék jellemzői:</strong></u>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5) Quattro, beleértve S4, 1994.11-2001.09-ig, (első tengely terhelés 1081-1150kg), Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-quattro-beleertve-s4-1994-11-2001-09-ig-els-tengely-terheles-1081-1150kg-comfort-series-allithato-magassagu-futomu'),
(119, '', '<p>A <strong>MTS-Technik Sport Series</strong> állítható magasságú sport futóművei ideális választás azok számára, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport</strong> futóművei optimális egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik</strong> lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n	<li><strong>Audi A4 Sedan</strong>: 1.8 Quattro / 1.8T Quattro / 2.4 Quattro / 2.6 Quattro / S4 Quattro / 2.8 Quattro / 1.9TDI Quattro / 2.5TDI Quattro</li>\n	<li><strong>Audi A4 Avant</strong>: 1.8 Quattro / 1.8T Quattro / 2.4 Quattro / 2.6 Quattro / S4 Quattro / 2.8 Quattro / 1.9TDI Quattro / 2.5TDI Quattro</li>\n	<li>Ültetés mértéke elöl: 40-100mm</li>\n	<li>Ültetés mértéke hátul: 20-80mm</li>\n	<li>Elülső tengely terhelés: 1081-1150kg</li>\n	<li>Hátsó tengely terhelés: 1130kg</li>\n	<li>Kivéve RS4</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach</strong> rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozásakor a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a fő szempont</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><u><strong>Termék jellemzők:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5) Quattro, beleértve S4, 1994.11-2001.09-ig, (első tengely terhelés 1081-1150kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-quattro-beleertve-s4-1994-11-2001-09-ig-els-tengely-terheles-1081-1150kg-sport-series-allithato-magassagu-futomu'),
(120, '', '<p>A <strong>MTS-Technik Sport Series</strong> állítható magasságú sport futóművei ideális választás azoknak, akik nem akarnak kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága fokozatmentesen. Az MTS-Technik Sport állítható futóművei tökéletes összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>A következő típusokhoz illik:</u></p>\n<ul>\n	<li><strong>Audi A4 Sedan</strong>, 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li>\n	<li><strong>Audi A4 Avant</strong>, 1.6 / 1.8 / 1.8T / 2.4 / 2.6 / 2.8 / 1.9TDI / 2.5TDI</li>\n	<li>Ültetés mértéke elöl: 40-90mm</li>\n	<li>Ültetés mértéke hátul: 45-100mm</li>\n	<li>Elülső tengely terhelés: 1081-1150kg</li>\n	<li>Hátsó tengely terhelés: 1185kg</li>\n	<li>Kivéve Quattro</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B5), kivéve Quattro, 1994.11-2001-ig, (első tengely terhelés 1081-1150kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b5-kiveve-quattro-1994-11-2001-ig-els-tengely-terheles-1081-1150kg-sport-series-allithato-magassagu-futomu'),
(121, '', '<div> \\n    <span style=\\\"color:#878787; font-family:OpenSans-Regular,sans-serif; font-size:13.3333px\\\"> </span>\\n    <strong>Különleges, testreszabható magasságú sport futómű</strong>', 'V-Maxx Audi A4 (Typ: B5), kivéve Quattro, 1994-2001-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b5-kiveve-quattro-1994-2001-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(122, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be a kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk, melyet a maximális ültetéssel egészítünk ki.</div> <div>A járműmagasság beállítására egy alumínium rugótányér segítségével van lehetőség a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtjük meg egy optimális felépítés révén.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A4 (Typ: B5) Sedan, Avant, kivéve Quattro, 1999.02-2000.10-ig, (8D*X 200000 alvázszámtól), (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b5-sedan-avant-kiveve-quattro-1999-02-2000-10-ig-8d*x-200000-alvazszamtol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(123, '', '<div>Az Ap futómű azoknak a vezetőknek szól, akik sportosan ambiciózusak, és milliméterre pontosan szeretnék beállítani az általuk kívánt ültetést. A maximális ültetést ötvözzük a sportos irányíthatósággal és optimális vezetési viselkedéssel.</div> <div>A járműmagasság egyénileg beállítható egy alumínium rugótányér segítségével a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot összehangolva optimális felépítést biztosítunk.</div> <ul> <li>kiváló minőségű termék megfizethető áron</li> <li>egyéni magasságbeállítás a TÜV által engedélyezett határok között</li> <li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A4 (Typ: B5) Sedan, Avant, kivéve Quattro, 1994.09-1999.01-ig, (8D*X 199999 alvázszámig), (első tengely terhelés 1081-1150kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b5-sedan-avant-kiveve-quattro-1994-09-1999-01-ig-8d*x-199999-alvazszamig-els-tengely-terheles-1081-1150kg-ig-allithato-magassagu-futomu'),
(124, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetőnek a kívánt ültetés milliméter pontos beállítására. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div> <div>Az alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>különleges ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A4 (Typ: B5) Sedan, Avant, kivéve Quattro, 1999.02-2000.10-ig, (8D*X 200000 alvázszámtól), (első tengely terhelés 1081-1150kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b5-sedan-avant-kiveve-quattro-1999-02-2000-10-ig-8d*x-200000-alvazszamtol-els-tengely-terheles-1081-1150kg-ig-allithato-magassagu-futomu'),
(125, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméterre pontosan beállítsák az általuk kívánt üléspozíciót. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját nyújtjuk, maximális ülésmagassággal kiegészítve.</div> <div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság párhuzamos összehangolása optimális konfigurációt biztosít.</div> <ul> <li>prémium minőség megfizethető áron</li> <li>személyre szabható magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> <li>kivételes ár-érték arány</li> <li>német gyártmányú minőség</li> </ul>', 'AP made by KW Audi A4 (Typ: B5) Sedan, Avant, kivéve Quattro, 1994.09-1999.01-ig, (8D*X 199999 alvázszámig), (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b5-sedan-avant-kiveve-quattro-1994-09-1999-01-ig-8d*x-199999-alvazszamig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(126, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy a kívánt ültetést milliméterre pontosan beállíthassa. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</div> <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása egy optimális felépítést biztosít.</div> <ul> <li>Magas minőségű termék megfizethető áron</li> <li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li> <li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>Kiemelkedő ár-érték arány</li> <li>Német minőség</li> </ul>', 'AP made by KW Audi A4 (Typ: B5) Sedan, Avant, Quattro, beleértve S4, 1995.02-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b5-sedan-avant-quattro-beleertve-s4-1995-02-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(127, '', '<div>Az Ap futómű lehetőséget kínál arra, hogy a sportosan ambiciózus vezető milliméterre pontosan beállíthassa az általa kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk a maximális ültetéssel összekapcsolva.</div> <div>Az alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság párhuzamos összehangolása optimális felépítést biztosít.</div> <ul> <li>prémium minőség megfizethető áron</li> <li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> <li>kivételes ár-érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A4 (Typ: B5) Sedan, Avant, Quattro, beleértve S4, 1995.02-től, (első tengely terhelés 1081-1150kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b5-sedan-avant-quattro-beleertve-s4-1995-02-tol-els-tengely-terheles-1081-1150kg-ig-allithato-magassagu-futomu'),
(128, '', '<div><strong>Audi A4 (Típus: B5) Vogtland állítható magasságú felfüggesztés</strong></div> <div> </div> <div>Kivéve Quattro</div> <div> </div> <div>Elülső tengely terhelhetősége: 1080 kg alatt</div> <div>Hátsó tengely terhelhetősége: 1185 kg alatt</div> <div>Alacsonyítás mértéke elöl: 40 - 70 mm</div> <div>Alacsonyítás mértéke hátul: 40 - 70 mm</div> <div> </div> <div>Az termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Audi A4 (Typ: B5) Sedan és Avant, kivéve Quattro, 1994.09-1999.01-ig, (első tengely terhelés: 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b5-sedan-es-avant-kiveve-quattro-1994-09-1999-01-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(129, '', '<div> <div><strong>Vogtland állítható magasságú futómû Audi A4 (Typ: B5) modellhez</strong></div> <div> </div> <div>Kizárólag nem Quattro változathoz</div> <div> </div> <div>Elsõ tengely maximális terhelése: 1080 kg felett</div> <div>Hátsó tengely maximális terhelése: 1185 kg alatt</div> <div>Ültetés elõl: 40 - 70 mm</div> <div>Ültetés hátul: 40 - 70 mm</div> <div> </div> <div>A futómû TÜV engedéllyel rendelkezik!</div> </div>', 'Vogtland Audi A4 (Typ: B5) Sedan és Avant, kivéve Quattro, 1994.09-1999.01-ig, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b5-sedan-es-avant-kiveve-quattro-1994-09-1999-01-ig-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(130, '', '<div><div><strong>Vogtland állítható magasságú futómű Audi A4 (Typ: B5) autókhoz</strong></div> <div> </div> <div>Kivéve azokat, amelyek Quattro hajtással rendelkeznek</div> <div> </div> <div>Az első tengely terhelése legfeljebb 1080 kg</div> <div>A hátsó tengely terhelése legfeljebb 1185 kg</div> <div>Az ültetés mértéke az első tengelynél: 40 - 70 mm</div> <div>Az ültetés mértéke a hátsó tengelynél: 40 - 70 mm</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div> </div>', 'Vogtland Audi A4 (Typ: B5) Sedan és Avant, kivéve Quattro, 1999.02-2000.10-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b5-sedan-es-avant-kiveve-quattro-1999-02-2000-10-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(131, '', '<div> <div><strong>Vogtland állítható magasságú futómű Audi A4 (Typ: B5) modellhez</strong></div> <div> </div> <div>Amely nem kompatibilis Quattro változattal</div> <div> </div> <div>Elülső tengely terhelési határ: több mint 1080 kg</div> <div>Hátsó tengely terhelési határ: kevesebb mint 1185 kg</div> <div>Elülső ültetés mértéke: 40 - 70 mm</div> <div>Hátsó ültetés mértéke: 40 - 70 mm</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div> </div>', 'Vogtland Audi A4 (Typ: B5) Sedan és Avant, kivéve Quattro, 1999.02-2000.10-ig, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b5-sedan-es-avant-kiveve-quattro-1999-02-2000-10-ig-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(132, '', '<div> <p><strong>Vogtland</strong> futómű szett az AUDI A4-hez</p>  <ul> 	<li><strong>Gyártási év</strong>: 1995-től</li> 	<li><strong>Ültetés mértéke:</strong> 40 - 65 / 40 - 65 mm</li> 	<li><strong>Modell</strong>: Audi A4, Typ 8D (B5), Lim. / Sedan, Avant, Quattro</li> 	<li><strong>Elülső tengelyterhelés</strong>: (maximum) 1080 kg</li> 	<li><strong>Hátsó tengelyterhelés</strong>: (maximum) 1130 kg</li> 	<li><strong>Jóváhagyás</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF12-32_1375-11.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF12-32_1375-11.pdf</a></li> </ul>  <p>A Vogtland állítható magasságú futómű szett nemcsak javítja az autó megjelenését, hanem garantálja a maximális vezetési élményt is. Az ültetés mértékét a felhasználó igényei szerint szabadon beállíthatja. A készlet kizárólag speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme elsőosztályú.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugók területén, 2 éves garanciát nyújt az ültető rugókra és lengéscsillapítókra!</p>  <p>A készlet általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968381</p> </div>', 'Vogtland Audi A4 (Typ: B5) Quattro Sedan és Avant, 1995.02-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b5-quattro-sedan-es-avant-1995-02-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(133, '', '<div> <p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p> <ul> <li><strong>Évjárat</strong>: 1995-től</li> <li><strong>Ültetés mértéke:</strong> lehetőség van az ültetés mértékének állítására</li> <li><strong>Típus</strong>: Az Audi A4, Typ 8D (B5) modellekhez készült, beleértve a Limousine / Sedan, Avant és Quattro változatokat, valamint az S4-et</li> <li><strong>Max. tengelyterhelés elöl</strong>: (1081 kg-tól) 1150 kg</li> <li><strong>Max. tengelyterhelés hátul</strong>: 1130 kg</li> <li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF12-32_1375-11.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF12-32_1375-11.pdf</a></li> </ul> <p>Ez a futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. Az ültetés mértéke szabadon állítható a felhasználó elképzeléseinek megfelelően. A kiváló minőségű futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező- vagy torziós futóművet alkalmaznak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968382</p> </div>', 'Vogtland Audi A4 (Typ: B5) Quattro Sedan és Avant, beleértve S4, 1995.02-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b5-quattro-sedan-es-avant-beleertve-s4-1995-02-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(134, '', '<p>Audi A4 Avant és Cabrio JOM BLUE LINE sport futómű</p>  <p>Az Audi A4 Avant és Cabrio modellekhez tervezett JOM BLUE LINE sport futómű, melynek magassága állítható. Ezt a futóművet a 8E / B6 + B7 típuskódú modellekhez ajánljuk, melyek gyártási éve 2000.11-től 2008.03-ig terjednek. A futómű kizárólag Avant és Cabrio típusokhoz alkalmas, Quattro modellekhez nem ajánlott.</p>  <p>A futómű hátsó tengelyén a magasságállító eszköz a rugó alatt található. Az elülső tengely terhelése 1250 kg, míg a hátsó tengelyé 1165 kg. A termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalálhat.</p>  <p>A futómű 2 ÉV TELJESKÖRŰ GARANCIÁVAL kapható, kiváló minőségben és rendkívül kedvező áron. A szett tartalmazza 4 darab lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 darab állítókulcsot az egyszerű beállításhoz.</p>', 'Jom Bochum Audi A4 (Typ: B6, B7) Avant és Cabrio, 1.6, 1.8T, 2.0, 2.0 FSi, 2.4, 3.0, 1.9TDi, 2.5TDi, kivéve Quattro, 2000.11-2008.03-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b6-b7-avant-es-cabrio-1-6-1-8t-2-0-2-0-fsi-2-4-3-0-1-9tdi-2-5tdi-kiveve-quattro-2000-11-2008-03-ig-blue-line-allithato-magassagu-futomu'),
(135, '', '<strong>Állítható magasságú sport futómű Audi A4 Sedan JOM BLUE LINE</strong></p>  <p>A JOM BLUE LINE sport futómű alkalmas Audi A4 Sedan típusú autókhoz (Típuskód: 8E / B6 + B7) a 2000.11 - 2008.03 közötti évekre. Kiemelkedő tulajdonsága, hogy a hátsó tengelynél a magasságállító a rugó alatt található. Az elő tengely terhelése 1250 kg, míg a hátsó tengelyé 1150 kg.</p>  <p>Ez a futómű MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 1 ÉV TELJESKÖRŰ GARANCIÁVAL rendelkezik.</p>  <p>A futómű ültetése -4 cm és -12 cm között állítható egy állítókulcs segítségével. A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 db állítókulcsot az állításhoz.</p>  <p>Ez a kiváló minőségű futómű hihetetlenül jó áron kapható, és ideális választás azok számára, akik szeretnék testreszabni autójukat és javítani az úttartását.</p>', 'Jom Bochum Audi A4 (Typ: B6, B7) Sedan, kivéve Quattro, 2000.11-2008.03-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b6-b7-sedan-kiveve-quattro-2000-11-2008-03-ig-blue-line-allithato-magassagu-futomu'),
(136, '', '<strong>Állítható magasságú sport futómű az Audi A4 Avant JOM BLUE LINE számára</strong></p>  <p>Az Audi A4 Avant JOM BLUE LINE számára készült sport futómű egyedi típuskóddal rendelkezik: 8E / B6 + B7</p>  <p>A futómű kompatibilis az évekkel: 2000.11 - 2008.03</p>  <p>Ez a modell Avant Quattro kivitelű</p>  <p>A futómű hátsó tengelynél található magasságállítója a rugó alatt helyezkedik el</p>  <p>Az elő tengely terhelése: 1250 kg</p>  <p>A hátsó tengely terhelése: 1165 kg</p>  <p>Ez a termék Németországban készült</p>  <p>A futómű rendelkezik német nyelvű TÜV engedéllyel, mely csomagoláson belül található</p>  <p>1 éves teljeskörű garanciával</p>  <p>Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével</p>  <p>Ez a futómű kiváló minőségű és rendkívül jó ár-érték arányú</p>  <p>A szett tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal és 2 db állítókulcsot az állításhoz</p>', 'Jom Bochum Audi A4 (Typ: B6, B7) Avant Quattro, 1.8T, 1.9TDi, 2.5TDi, 3.0, 2000.11-2008.03-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b6-b7-avant-quattro-1-8t-1-9tdi-2-5tdi-3-0-2000-11-2008-03-ig-blue-line-allithato-magassagu-futomu'),
(137, '', '<p>Egy olyan sportos futómű, amelyet az Audi A4 Avant és Cabrio Quattro modellekhez terveztek, és a JOM BLUE LINE nevet kapta.</p> <p>Ez a futómű képes a magasság állítására a hátsó tengelyen, ahol a magasságállító a rugó alatt található.</p> <p>Ez a termék kódja: 8E / B6 + B7, és az években 2000.11 - 2008.03 gyártott modellekhez megfelelő.</p> <p>A futómű terhelése elöl 1250 kg, míg hátul 1165 kg.</p> <p>Ez a futómű MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalál.</p> <p>Ez a kiváló minőségű futómű 2 ÉV TELJESKÖRŰ GARANCIÁVAL rendelkezik, és hihetetlenül jó áron kapható.</p> <p>A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 állítókulcsot is.</p>', 'Jom Bochum Audi A4 (Typ: B6, B7) Avant és Cabrio Quattro, 2000.11-2008.03-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b6-b7-avant-es-cabrio-quattro-2000-11-2008-03-ig-blue-line-allithato-magassagu-futomu'),
(138, '', '<p>Egy Audi A4 FK Automotive termék, mely állítható magasságú sport futóművet kínál az 8E / B6, B7 típuskódú modellekhez, melyek gyártása 2000.11 és 2008.03 között történt. Ez a futómű alkalmas Limousine és Avant típusokhoz, és elöl 1250 kg, míg hátul 1150 kg tengelyterhelést képes elviselni. A termék Made in Germany és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban találsz. Ráadásul 1 ÉV TELJESKÖRŰ GARANCIÁVAL!</p>', 'FK-Automotive Audi A4 (typ: B6, B7) Sedan és Avant, kivéve Quattro, 2000.11-2008.03-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a4--b6-b7-sedan-es-avant-kiveve-quattro-2000-11-2008-03-ig-allithato-magassagu-futomu'),
(139, '', '<p>Egy állítható magasságú sport futómű az Audi A4 FK Automotive-tól</p>\\r\\n\\r\\n<p>A futómű megfelel a típuskódnak: 8E / B6, B7, kizárólag Quattro modellekhez</p>\\r\\n\\r\\n<p>Gyártási éve: 2000.11 - 2008.03</p>\\r\\n\\r\\n<p>Kiváló választás Limousine és Avant Quattro típusokhoz</p>\\r\\n\\r\\n<p>Elülső tengelyterhelés: 1250 kg</p>\\r\\n\\r\\n<p>Hátsó tengelyterhelés: 1150 kg</p>\\r\\n\\r\\n<p>Gyártva Németországban</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban találsz</p>\\r\\n\\r\\n<p>1 év teljes körű garanciával!!!</p>', 'FK-Automotive Audi A4 (typ: B6, B7) Sedan és Avant Quattro, 2000.11-2008.03-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a4--b6-b7-sedan-es-avant-quattro-2000-11-2008-03-ig-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(140, '', '<div>\\nAz Audi A4 (Typ: B6, B7) modellekhez kifejlesztett sport futómű, melynek magassága állítható.\\n</div>', 'V-Maxx Audi A4 (Typ: B6, B7) Avant és Cabrio, kivéve Quattro, 2000.11-2007-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-avant-es-cabrio-kiveve-quattro-2000-11-2007-ig-allithato-magassagu-futomu'),
(141, '', '<div><strong>Audi A4 (B6, B7 típusú) modellekhez kifejlesztett V-Maxx sport futómű állítható magassággal</strong></div>', 'V-Maxx Audi A4 (Typ: B6, B7) Sedan Quattro, 2000.11-2007-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-sedan-quattro-2000-11-2007-ig-allithato-magassagu-futomu'),
(142, '', '<div>\\nAz Audi A4 (B6, B7 modell) V-Maxx futómű rendszere módosítható magasságú és dinamikus megjelenésű.\\n</div>', 'V-Maxx Audi A4 (Typ: B6, B7) Avant és Cabrio, csak Quattro, 2000.11-2007-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-avant-es-cabrio-csak-quattro-2000-11-2007-ig-allithato-magassagu-futomu'),
(143, '', '<div>\n    <div>\n        <em>Exkluzív méretű sport futómű a Audi A4 (Typ: B6, B7) modellekhez</em>\n    </div>\n</div>', 'V-Maxx Audi A4 (Typ: B6, B7) Sedan, kivéve Quattro, 2000.11-2007-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-sedan-kiveve-quattro-2000-11-2007-ig-allithato-magassagu-futomu'),
(144, '', 'Az MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Az állítható magasság segítségével könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóműveinek rugóit az Eibach gyártja, melyek fokozatmentesen állíthatók 25 és 80 mm között. A futóművek gáztöltésű lengéscsillapítókkal rendelkeznek, melyek magas hatékonyságot biztosítanak extrém igénybevétel mellett is. A korrózióvédelem érdekében két rétegű bevonattal rendelkeznek, sárga cink bevonattal és fekete anodyzált alumínium alkatrészekkel. Az optimális összhangot a rugók és a lengéscsillapítók között garantálják. A futóművek készlete plug & play, így nem igényel módosítást az autó felfüggesztésében.', 'MTS-Technik by Nord Performance Audi A4 (Typ: B7) Sedan, kivéve Quattro, 2004.11-2008.06-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b7-sedan-kiveve-quattro-2004-11-2008-06-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(145, '', '<div>\n    <p>Az MTS-Technik által kínált sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A futóművek magassága folyamatosan állítható, lehetővé téve az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n    <p></p>\n    <p><u>Termékjellemzők:</u></p>\n    <ul>\n        <li>A futóművek rugóit az Eibach vállalat gyártja.</li>\n        <li>A magasság széles határok között szabadon állítható, általában 25 és 80 mm között.</li>\n        <li>A lengéscsillapítók gáztöltésűek.</li>\n        <li>Magas hatékonyság jellemzi extrém igénybevétel mellett is.</li>\n        <li>A hosszú távú korrózióvédelem érdekében két rétegű bevonat található (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n        <li>Tökéletes az összhang a rugók és a lengéscsillapítók között.</li>\n        <li>A készlet egyszerűen telepíthető, nem igényel módosítást az autó felfüggesztésén.</li>\n    </ul>\n</div>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Avant, 2001.04-2008.06-ig, kivéve Quattro, (első tengely terhelés 1081-1230kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-avant-2001-04-2008-06-ig-kiveve-quattro-els-tengely-terheles-1081-1230kg-allithato-magassagu-futomu'),
(146, '', 'Az MTS-Technik állítható magasságú sport futóművei ideális választást jelentenek azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Az állítható magasság lehetővé teszi, hogy könnyedén alkalmazkodj az útviszonyokhoz, így optimalizálva az autó hasmagasságát. Az MTS-Technik futóművei kiemelkednek a rugók és lengéscsillapítók közötti optimális egyensúlyukkal.\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>az állítható magasságú futóművek rugóit a <strong>Eibach</strong> gyártja</li>\n	<li>a magasság fokozatmentesen állítható általában 25 és 80 mm között</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>kiváló hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>ideális egyensúly a rugók és lengéscsillapítók között</li>\n	<li>a készlet könnyen telepíthető, nem igényel változtatást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Avant, kivéve Quattro, 2001.04-2008.06-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-avant-kiveve-quattro-2001-04-2008-06-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(147, '', '<p>Az MTS-Technik állítható magasságú futóművei ideális választásnak bizonyulnak azok számára, akik számára kiemelten fontos a kiváló minőség és a versenyképes ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed és pontos beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkednek az optimális rugók és lengéscsillapítók közötti tökéletes egyensúlyukkal.</p>\n\n<p><u>Fontos jellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit a <strong>Eibach</strong> cég gyártja.</li>\n	<li>A magasság szinte korlátlanul, legtöbb esetben 25 és 80 mm között állítható.</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is.</li>\n	<li>Két rétegű bevonattal rendelkezik a hosszantartó korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek.</li>\n	<li>A futómű tökéletes összhangot biztosít a rugók és lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Sedan Quattro, 2001.04-2008.06-ig, (első tengely terhelés 1081-1230kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-sedan-quattro-2001-04-2008-06-ig-els-tengely-terheles-1081-1230kg-allithato-magassagu-futomu'),
(148, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az kedvező ár. Az állítható magasság lehetővé teszi az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimalizált rugók és lengéscsillapítók kombinációjával rendelkeznek.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonattal a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Rugó és lengéscsillapító tökéletes egyensúlya</li>\n	<li>A készlet plug & play, nem szükséges módosítás az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Sedan, kivéve Quattro, 2001.04-2008.06-ig, (első tengely terhelés 1081-1220kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-sedan-kiveve-quattro-2001-04-2008-06-ig-els-tengely-terheles-1081-1220kg-allithato-magassagu-futomu'),
(149, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A magasság fokozatmentesen változtatható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóműveinél tökéletes az egyensúly a rugók és a lengéscsillapítók között. </p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul> 	\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	\n	<li>A magasság általában 25 és 80 mm között állítható</li> 	\n	<li>Gáztöltésű lengéscsillapítók</li> 	\n	<li>Extrém igénybevétel esetén is magas hatékonyság</li> 	\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	\n	<li>Kit plug & play kivitelben, nem igényel módosítást az autó felfüggesztésében</li> \n</ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Avant Quattro, 2001.04-2008.06-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-avant-quattro-2001-04-2008-06-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(150, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság fokozatmentesen szabályozható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiváló összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n    <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n    <li>a magasság rugalmasan szabályozható általában 25 és 80 mm között</li>\n    <li>gáztöltésű lengéscsillapítók</li>\n    <li>kiemelkedő hatékonyság extrém igénybevételek során is</li>\n    <li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében: sárga cinkbevonat és fekete anódizált alumínium alkatrészek</li>\n    <li>tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n    <li>a készlet gyorsan és egyszerűen telepíthető, nem szükséges módosítás az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Avant Quattro, 2001.04-2008.06-ig, (első tengely terhelés 1081-1230kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-avant-quattro-2001-04-2008-06-ig-els-tengely-terheles-1081-1230kg-allithato-magassagu-futomu'),
(151, '', 'Az MTS-Technik állítható magasságú sport futóművei ideális választást jelenthetnek azoknak, akik számára fontos a kiváló minőség és az kedvező ár. A magasság fokozatmentesen szabályozható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveinél kiemelkedő az optimális egyensúly a rugók és a lengéscsillapítók között.\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja.</li>\n	<li>A magasság szabadon szabályozható általában 25 és 80 mm között.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Kiemelkedő hatékonyság extrém igénybevételek mellett is.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek).</li>\n	<li>Ideális egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B6, B7) Sedan Quattro, 2001.04-2008.06-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b6-b7-sedan-quattro-2001-04-2008-06-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(152, '', '<div>\\n<br>\\n<strong style=\\\\\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\\\\\">Sportos futómű, melyet állítható magasságú V-Maxx futóműnek neveznek, elérhető Audi A4 modellekhez.</strong>', 'V-Maxx Audi A4 (Typ: B6, B7) Sedan, kivéve Quattro, 2000.11-2007-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-sedan-kiveve-quattro-2000-11-2007-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(153, '', '<div>\n<p>Egy olyan sport futómű, amelyet be lehet állítani az Audi A4 B6 és B7 típusú modellekhez.</p>\n</div>', 'V-Maxx Audi A4 (Typ: B6, B7) Sedan Quattro, 2000.11-2007-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-sedan-quattro-2000-11-2007-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(154, '', '<div>\\nAz Audi A4 típusok (B6, B7 modellek) \\n<br>\\nV-Maxx márkájú rugós felfüggesztés\\n</div>', 'V-Maxx Audi A4 (Typ: B6, B7) Avant és Cabrio, csak Quattro, 2000.11-2007-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-avant-es-cabrio-csak-quattro-2000-11-2007-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(155, '', '<div>\\nAz Audi A4 modellek (B6, B7) esetében elérhető a V-Maxx sport futómű, amely extra teljesítményt és sportosabb vezetési élményt biztosít.\\n</div>', 'V-Maxx Audi A4 (Typ: B6, B7) Avant és Cabrio, kivéve Quattro, 2000.11-2007-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b6-b7-avant-es-cabrio-kiveve-quattro-2000-11-2007-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(156, '', '<strong>Vogtland</strong> állítható magasságú futómű szett az Audi A4 típusú autókhoz</p>  <ul> 	<li><strong>Évjárat</strong>: 2001-2008</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), beleértve Facelift, (8E, 8H) Lim. / Sedan, 2WD, kivéve szintező modellek</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF27-28_1453-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF27-28_1453-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett maximális vezetési élményt nyújt. A futómű szett lehetővé teszi az ültetés mértékének személyre szabott beállítását. A lengéscsillapítók alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az elsőosztályú korrózióvédelemmel rendelkező lengéscsillapítók speciális, nagy teljesítményű kétcsöves kivitelűek.</p>  <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra, akik több mint 100 éves tapasztalattal rendelkeznek a rugógyártás terén.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Készült Németországban!</p>  <p>Cikkszám: 968383</p> ', 'Vogtland Audi A4 (Typ: B6, B7) Sedan, kivéve Quattro, 2001-2008-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-sedan-kiveve-quattro-2001-2008-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(157, '', '<div> <p>Ez a moduláris AP-Fahrwerke futómű egy olyan autótípushoz készült, melynek részletei a következők:</p>  <ul> 	<li>Audi A4 Sedan, Elsőkerék-hajtás, beleértve a Facelift verziót is</li> 	<li>Típuskód: B6, B7</li> 	<li>Típusváltozat: Sedan</li> 	<li>Gyártási év: 2000.11-től</li> 	<li>Tengelyterhelés elöl: 1220 kg</li> 	<li>Tengelyterhelés hátul: 1150 kg</li> 	<li>Egyéb megjegyzések: Kivéve Quattro modellek<br /> 	Kivéve az automatikus szintszabályzóval rendelkező vagy utólag felszerelhető modelleket.</li> </ul>  <ul> 	<li>Ez a futóműkészlet rendelkezik német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben szereplő ültetési tartomány elöl: 35-65 mm, hátul: 35-65 mm<br /> 	(Mindig nagyobb tartományban is állítható a futómű, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li> 	<li>Extra ültetési lehetőség elöl: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártva az Ap-Fahrwerke németországi üzemében</li> 	<li>Garancia: 2 év a termékre</li> </ul>  <p><strong>Termékkód: GF10-028</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Audi A4 (Typ: B6, B7) Sedan, beleértve Facelift (Typ: 8E, 8H), kivéve Quattro, 2000.11-től, (első tengely terhelés 1081-1250kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-sedan-beleertve-facelift-typ-8e-8h-kiveve-quattro-2000-11-tol-els-tengely-terheles-1081-1250kg-ig-allithato-magassagu-futomu'),
(158, '', '<div>\n  <p>Ez az AP-Fahrwerke Állítható magasságú futómû egy olyan autótípushoz készült, amelyben az első kerekek hajtják a járművet és beleértve a Facelift verziót is.</p>\n  <ul>\n    <li>Az autótípusok: Audi A4 Avant, Cabrio</li>\n    <li>Típuskód: B6, B7</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 2000.11-től</li>\n    <li>Tengelyterhelés elöl (kg): 1080</li>\n    <li>Tengelyterhelés hátul (kg): 1165</li>\n    <li>Egyéb kitételek: Kivéve Quattro, automata szintszabályzóval ellátott vagy beépíthető modellek</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetés mérése elöl: 35-65 mm, hátul: 35-60 mm tartományban állítható</li>\n    <li>Plussz ültetés lehetőség elöl: +50 mm, hátul: +0 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: Made In Ap-Fahrwerke Németország</li>\n    <li>Garancia: 2 év a termékre</li>\n  </ul>\n  <p><strong>Cikkszám: GF10-029</strong></p>\n  <p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Audi A4 (Typ: B6, B7) Avant, Cabrio, beleértve Facelift (Typ: 8E, 8H), kivéve Quattro, 2000.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-avant-cabrio-beleertve-facelift-typ-8e-8h-kiveve-quattro-2000-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(159, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû az alábbi autótípushoz illeszkedik:</p>  <ul> 	<li>Audi A4 Avant, Cabrio, Beleértve Facelift</li> 	<li>Tipuskód: B6</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2000.11-tõl</li> 	<li>Tengelyterhelés elöl (kg): 1250</li> 	<li>Tengelyterhelés hátul (kg): 1165</li> 	<li>Egyéb kitételek: Kivéve Quattro<br /> 	Kivéve automata szintszabályzóval ellátott vagy automata szintszabályzóval beépithetõ modellek.</li> </ul>  <ul> 	<li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li> 	<li>Az engedély által meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-60 mm között állítható<br /> 	(Minden esetben nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetõség elöl: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>Garancia e termékre: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-030</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div> ', 'AP made by KW Audi A4 (Typ: B6, B7) Avant, Cabrio, beleértve Facelift (Typ: 8E, 8H), kivéve Quattro, 2000.11-től, (első tengely terhelés 1081-1250kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-avant-cabrio-beleertve-facelift-typ-8e-8h-kiveve-quattro-2000-11-tol-els-tengely-terheles-1081-1250kg-ig-allithato-magassagu-futomu'),
