(161, '', '<div> <p>Ez a Magasságállítható AP-Fahrwerke futómű megfelel az alábbi autótípusnak:</p>  <ul> 	<li>Audi A4 Avant, Cabrio, beleértve a Facelift verziót</li> 	<li>Tipuskód: B6</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2000.11-től</li> 	<li>Tengelyterhelés elöl (kg): 1250</li> 	<li>Tengelyterhelés hátul (kg): 1165</li> 	<li>Egyéb megjegyzés: Kivéve Quattro<br /> 	Kivéve olyan modellek, amelyek automatikus szintszabályozóval rendelkeznek vagy amelyekhez automatikus szintszabályzó felszerelhető.</li> </ul>  <ul> 	<li>Ez a futómű összeállítás Német nyelvű TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elől: 35-65 mm, hátul: 35-60 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fent említett beállításokkal érvényes.)</li> 	<li>Extra ültetési lehetőség elől: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártás helye: Ap-Fahrwerke, Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszám: GF10-030</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div> ', 'AP made by KW Audi A4 (Typ: B6, B7) Sedan Quattro, 2000.11-től, (első tengely terhelés 1081-1230kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-sedan-quattro-2000-11-tol-els-tengely-terheles-1081-1230kg-ig-allithato-magassagu-futomu'),
(162, '', '<div> <p>Ez az állítható magasságú futómű az AP-Fahrwerke terméksorozatból ideális választás az alábbi autótípusokhoz:</p>  <ul> 	<li>Audi A4 Avant, Cabrio és Quattro modellekhez</li> 	<li>Megfelelő típuskódok: B6, B7</li> 	<li>Speciális típusváltozat: Quattro</li> 	<li>Alkalmazható évjárat: 2000.11-től kezdve</li> 	<li>Elülső tengelyterhelés: 1080 kg</li> 	<li>Hátsó tengelyterhelés: 1165 kg</li> 	<li>Kivételek: Az automatikus szintszabályzóval rendelkező vagy ehhez kiegészítő opcióval felszerelt modellek</li> </ul>  <ul> 	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel</li> 	<li>Az engedély által meghatározott ültetési tartomány: elöl 35-65 mm, hátul 35-60 mm között állítható<br /> 	(Mindig lehet nagyobb intervallumban is beállítani a futóművet, de a TÜV engedély csak az említett beállításokra vonatkozik)</li> 	<li>Lehetséges extra ültetés: elöl +60 mm, hátul +5 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Termékgarancia: 2 év</li> </ul>  <p><strong>Termék cikkszáma: GF10-057</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div> ', 'AP made by KW Audi A4 (Typ: B6, B7) Avant, Cabrio Quattro, 2000.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-avant-cabrio-quattro-2000-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(163, '', '<div> <p>Ez a magasságállítható AP-Fahrwerke futóművet az alábbi autótípusokhoz tervezték:</p>  <ul> 	<li>Audi A4 Avant, Cabrio, Quattro</li> 	<li>Tipuskód: B6, B7</li> 	<li>Típus variáció: Quattro</li> 	<li>Évjárat: 2000.11-től</li> 	<li>Tengelyterhelés elöl (kg): 1250</li> 	<li>Tengelyterhelés hátul (kg): 1165</li> 	<li>Egyéb kitételek: Automata szintszabályzóval nem kompatibilis modellekre</li> </ul>  <ul> 	<li>Ez a futóműkészlet rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elől: 35-65 mm, hátul: 35-60 mm között állítható<br /> 	(A futómű nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li> 	<li>Extra ültetési lehetőség elől: +60 mm, hátul: +5 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Termék kódja: GF10-058</strong></p>  <p><br /> Az ár egy készletre vonatkozik!</p> </div>', 'AP made by KW Audi A4 (Typ: B6, B7) Avant, Cabrio Quattro, 2000.11-től, (első tengely terhelés 1081-1250kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-avant-cabrio-quattro-2000-11-tol-els-tengely-terheles-1081-1250kg-ig-allithato-magassagu-futomu'),
(164, '', '<div> <p>Ez a AP-Fahrwerke Állítható magasságú futómű a következő Audi A4 Limousine típusokhoz illeszkedik: elsőkerék-hajtású, beleértve a Facelift modelleket.</p>  <ul> 	<li>Tipuskód: B6, B7</li> 	<li>Típus variáció: Limousine</li> 	<li>Évjárat: 2000.11-től</li> 	<li>Tengelyterhelés elöl (kg): 1080</li> 	<li>Tengelyterhelés hátul (kg): 1150</li> 	<li>Egyéb kitételek: Kivéve Quattro, automata szintszabályzóval ellátott vagy beépíthető modellek.</li> </ul>  <ul> 	<li>Ez a futómű Németországban gyártott, és rendelkezik Német nyelvű TÜV engedéllyel.</li> 	<li>Az engedélyben meghatározott ültetési tartomány elöl: 35-65 mm, hátul: 35-65 mm között állítható.</li> 	<li>Plussz ültetési lehetőség elöl: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-027</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Audi A4 (Typ: B6, B7) Sedan, beleértve Facelift (Typ: 8E, 8H), kivéve Quattro, 2000.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b6-b7-sedan-beleertve-facelift-typ-8e-8h-kiveve-quattro-2000-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(165, '', '<p>Egy állítható magasságú futómű szett a Vogtlandtól az AUDI A4-hez. Ez a termék lehetővé teszi az autó megjelenésének javítását, miközben optimális vezetési élményt nyújt. A futómű szett tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak és TÜV minősítéssel rendelkeznek.</p>\n\n<p>Az AUDI A4-hez való Vogtland futómű szett az alábbi paraméterekkel rendelkezik:</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2001-2008</li>\n	<li><strong>Ültetés mértéke</strong>: 35 - 60 / 35 - 60 mm</li>\n	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), beleértve Facelift, (8E, 8H) Avant, Cabrio, 2WD</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1080 kg) 1250 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1165 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf</a></li>\n</ul>\n\n<p>A Vogtland cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintezős vagy torziós futómű van.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968386</p>', 'Vogtland Audi A4 (Typ: B6, B7) Avant és Cabrio, beleértve Facelift, kivéve Quattro, 2000.11-től, (első tengely terhelés: 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-avant-es-cabrio-beleertve-facelift-kiveve-quattro-2000-11-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(166, '', '<p><strong>Vogtland</strong> által kifejlesztett állítható magasságú futómű szett az <strong>AUDI A4</strong> típushoz.</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2001-2008</li>\n	<li><strong>Ültetés mértéke:</strong> 35 - 60 / 35 - 60 mm</li>\n	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), Lim. / Sedan, Quattro, beleértve S4</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: (1080 kg-tól) 1250 kg</li>\n	<li><strong>Max. tengelyterhelés hátu</strong>l: 1165 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf</a></li>\n</ul>\n<p>A Vogtland futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. Az ültetés mértékét az egyéni igények szerint szabályozhatja. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel rendelkeznek.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968309</p>', 'Vogtland Audi A4 (Typ: B6, B7) Sedan Quattro, beleértve S4, 2001-2008-ig, (első tengely terhelés 1081-1220kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-sedan-quattro-beleertve-s4-2001-2008-ig-els-tengely-terheles-1081-1220kg-allithato-magassagu-futomu'),
(167, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás az AUDI A4 típusú autókhoz, évjáratra való tekintet nélkül. Ez a minőségi futómű szett lehetővé teszi az autó megjelenésének javítását és maximális vezetési élményt nyújt. A futómű beállításával a felhasználó saját elképzelése szerint szabályozhatja az ültetés mértékét. A készlet speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett általában 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p>A Vogtland futóművek németországi gyártásúak, és a termék kiváló minőségű, Made in Germany!</p>\n<p>Cikkszám: 968384</p>', 'Vogtland Audi A4 (Typ: B6, B7) Sedan, kivéve Quattro, 2001-2008-ig, (első tengely terhelés 1081-1220kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-sedan-kiveve-quattro-2001-2008-ig-els-tengely-terheles-1081-1220kg-allithato-magassagu-futomu'),
(168, '', '<div> <p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2001-2008</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 60 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), beleértve Facelift, (8E, 8H) Avant, Cabrio, 2WD, kivéve szintező modellek</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1165 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf</a></li> </ul>  <p>Az autó külső megjelenésén javítva, ez a futómű szett optimális vezetési élményt nyújt. Lehetőség van az ültetés mértékének személyre szabására. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a kiváló minőségű futóműhöz.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968385</p> </div>', 'Vogtland Audi A4 (Typ: B6, B7) Avant és Cabrio, beleértve Facelift, kivéve Quattro, 2000.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-avant-es-cabrio-beleertve-facelift-kiveve-quattro-2000-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(169, '', '<strong>Vogtland</strong> állítható magasságú futómű szett az Audi A4 típushoz</p>  <ul> 	<li><strong>Évjárat</strong>: 2001-2008</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 60 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), Lim. / Sedan, Quattro</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1165 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF29-30_1454-10.pdf</a></li> </ul>  <p>A Vogtland futómű szett nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is biztosít. A beállítható ültetésnek köszönhetően az autó tulajdonosa személyre szabhatja a magasságot. Ez a futómű szett kiváló minőségű, nagy teljesítményű lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A futómű szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, amelyek szintezővel vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968308</p> ', 'Vogtland Audi A4 (Typ: B6, B7) Sedan Quattro, 2001-2008-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-sedan-quattro-2001-2008-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(170, '', '<div> <div> <p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2001-2008</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), Avant, Cabrio, Quattro, kivéve szintező modellek</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1250 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1165 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF57-58_1459-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF57-58_1459-10.pdf</a></li> </ul>  <p>Az autó megjelenését javító Vogtland állítható magasságú futómű szett AUDI A4 típusú autókhoz az optimális vezetési élményt nyújtja. Az ültetés mértékét személyre szabottan állíthatja be az ideális értékekre. Ez a kiváló minőségű futómű szett kizárólag magas teljesítményű, kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott kényelmet és dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintező- vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968311</p> </div> </div>', 'Vogtland Audi A4 (Typ: B6, B7) Quattro, Avant és Cabrio, beleértve S4, 2000.11-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-quattro-avant-es-cabrio-beleertve-s4-2000-11-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(171, '', '<div> <p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2001-2008</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8E (B6/7), Avant, Cabrio, Quattro, kivéve szintező modellek</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1165 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF57-58_1459-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF57-58_1459-10.pdf</a></li> </ul>  <p>Az autó megjelenésén javítva maximális vezetési élményt nyújt. Az ültetés mértékét szabadon állíthatja az ön elképzelése szerint. Ez a futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  <p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968310</p> </div> ', 'Vogtland Audi A4 (Typ: B6, B7) Quattro, Avant és Cabrio, 2000.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b6-b7-quattro-avant-es-cabrio-2000-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(172, '', '<p>Egy tökéletes kiegészítő az Audi A4 B8 Avant modellhez, a JOM BLUE LINE állítható magasságú sport futómű. Ez a futómű megfelel a B8 (8K) típuskódnak, és az 2007.11 - 2011 közötti években gyártott modellekhez passzol. Különböző motorváltozatokhoz használható, mint például a 1.8 TFSI, 1.8 TFSI Quattro, 2.0 TDI, 2.0 TDI Quattro, 2.0 TFSI, 2.7 TDI, 3.0 TDI Quattro, 3.2 FSI, 3.2 FSI Quattro.</p>\n<p>A futómű hátsó tengelyén a magasságállító a rugó alatt található. Az első tengely terhelése 1215kg, míg a hátsó tengelyé 1240 kg. Ez a minőségi termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalálható.</p>\n<p>Az ajánlat 2 ÉV TELJESKÖRŰ GARANCIÁVAL érhető el! A futómű kiváló minőségű és hihetetlenül jó áron kapható. A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot.</p>', 'Jom Bochum Audi A4 (Typ: B8) Avant, beleértve Quattro, 2007.11-2011-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b8-avant-beleertve-quattro-2007-11-2011-ig-blue-line-allithato-magassagu-futomu'),
(173, '', '<p>Egy állítható magasságú sport futómű, JOM BLUE LINE néven, mely az Audi A4 B8 Sedanhoz készült.</p>\\r\\n\\r\\n<p>A futómű megfelelő a B8 (8K) típuskódú modellekhez, melyek gyártási éve 2007 novemberétől 2011-ig terjedtek.</p>\\r\\n\\r\\n<p>Különböző motorváltozatokkal kompatibilis, mint például a 1.8 TFSI, 2.0 TDI, 2.0 TFSI, 2.7 TDI, 3.0 TDI, 3.2 FSI.</p>\\r\\n\\r\\n<p>A futómű tartalmazza a Quattro összkerékhajtás lehetőségét is.</p>\\r\\n\\r\\n<p>A hátsó tengelynél a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>A futómű megfelel a német minőségi előírásoknak, és TÜV engedéllyel rendelkezik, melyet a csomagolásban megtalál.</p>\\r\\n\\r\\n<p>Két év teljeskörű garanciával kapható, így biztos lehet a minőségében.</p>\\r\\n\\r\\n<p>Az ajánlat tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint egy állítókulcsot.</p>', 'Jom Bochum Audi A4 (Typ: B8) Sedan, beleértve Quattro, 2007.11-2011-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b8-sedan-beleertve-quattro-2007-11-2011-ig-blue-line-allithato-magassagu-futomu'),
(174, '', '<p>Egy Audi A4 Avant FK-Automotive AK Street Állítható Magasságú Futómű, mely ideális választás a 2008-tól gyártott Audi A4 B8 Avant modellekhez. Ennek a futóműnek az ültetését 2,5 és 10 cm között lehet beállítani, lehetővé téve számodra az optimális magasság kiválasztását. Emellett 1 év garancia is jár a termékre, ami tovább növeli a bizalmat benne.</p>\n<p>Az FK-Automotive AK Street futómű első és hátsó részén is állítható, így teljes kontrollt biztosít az autód magasságának beállításában. A nagy intervallumon belül szabadon változtathatod a futómű magasságát, így személyre szabott vezetési élményt biztosítva.</p>\n<p>Ez a futómű sportos, feszes és strapabíró, valamint rendelkezik TÜV engedéllyel is, így biztos lehetsz benne, hogy megfelel az összes biztonsági előírásnak. A futómű anyaga acél, és a cikkszáma: SMAI9011.</p>', 'FK-Automotive Audi A4 (Typ: B8) Avant, beleértve Quattro, 2007.11-2011-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a4-typ-b8-avant-beleertve-quattro-2007-11-2011-ig-allithato-magassagu-futomu'),
(175, '', '<p>Egy olyan futómű, melyet Audi A4 B8 Sedan típusú autókhoz terveztek, évjáratától függetlenül. A futómű ültetését 2,5 és 10 cm között lehet beállítani, így rugalmasan alkalmazkodik az egyéni igényekhez. Az AK Street futóműre 1 év garancia vonatkozik, és mind elöl, mind hátul könnyedén beállítható a magassága. Ez a sportos, strapabíró futómű nagy intervallumban képes a magasság beállítására, és TÜV engedéllyel rendelkezik az biztonság érdekében. Az FK-Automotive AK Street futómű anyaga acél, cikkszáma pedig SMAI9009.</p>', 'FK-Automotive Audi A4 (Typ: B8) Sedan, beleértve Quattro, 2007.11-2011-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a4-typ-b8-sedan-beleertve-quattro-2007-11-2011-ig-allithato-magassagu-futomu'),
(176, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akiknek fontos a kiváló minőség és a versenyképes ár. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között.</p><p><u>Termékjellemzők:</u></p><ul>	<li>A rugókat az Eibach gyártja</li>	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>	<li>Gáztöltésű lengéscsillapítók</li>	<li>Kiváló hatékonyság extrém körülmények között is</li>	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li></ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B8), beleértve Quattro, 2007.11-2015.12-ig, (első tengely terhelés 1081-1245kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b8-beleertve-quattro-2007-11-2015-12-ig-els-tengely-terheles-1081-1245kg-allithato-magassagu-futomu'),
(177, '', '<p>Az MTS-Technik által kifejlesztett sport futóművek állítható magasságúak, és ideális választás azok számára, akik kiváló minőséget szeretnének megfizethető áron. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodjon az útviszonyokhoz. Az MTS-Technik futóművei kiváló összhangot biztosítanak a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú élettartam érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B8), beleértve Quattro, 2007.11-2015.12-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b8-beleertve-quattro-2007-11-2015-12-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(178, '', '<br /><div><br /><p>Olyan sportos futóművet kínálunk az Audi A4 (Typ: B8) Avant modellekhez, amely lehetővé teszi a keménység könnyű beállítását a V-Maxx rendszer segítségével. Ennek a futóműnek köszönhetően élvezheted az dinamikusabb vezetési élményt, és autód számára jobb teljesítményt biztosít.</p><br /></div><br />', 'V-Maxx Audi A4 (Typ: B8) Avant, beleértve Quattro, kivéve RS4, 2008.04-2015.12-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b8-avant-beleertve-quattro-kiveve-rs4-2008-04-2015-12-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(179, '', '<br /><div><br /><p>Olyan sport futóművet keres, amelynek keménysége állítható és V-Maxx gyártmányú, hogy beszerelhesse az Audi A4 (Typ: B8) Sedan autójába.</p><br /></div><br />', 'V-Maxx Audi A4 (Typ: B8) Sedan, beleértve Quattro, kivéve RS4, 2007.11-2015.12-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-a4-typ-b8-sedan-beleertve-quattro-kiveve-rs4-2007-11-2015-12-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(180, '', '<div> <p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2007.11-től</li> 	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Lim. / Sedan, 2WD, Quattro, kivéve elektronikus lengéscsillapító szabályzással szerelt</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása és a vezetési élmény maximalizálása érdekében ez a futómű szett ideális választás. Az ültetés mértékét a felhasználó saját elképzelése szerint állíthatja be az optimális értékek között. A kiváló minőségű futómű szett speciális, nagyteljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerrel rendelkeznek, biztosítva ezzel a kiegyensúlyozott komfortot és a fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező- vagy torziós futóművet szereltek fel.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968113</p> </div>', 'Vogtland Audi A4 (Typ: B8) Sedan, kivéve elektronikus lengéscsillapító szabályzással szerelt, 2007.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-sedan-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(181, '', '<div> <p><strong>Vogtland</strong> állítható magasságú futómû szett: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2008.04-tõl</li> 	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Avant, 2WD, Quattro, kivéve elektronikus lengéscsillapító szabályzással szerelt</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF77-78_1398-11.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF77-78_1398-11.pdf</a></li> </ul>  <p>Az autó megjelenését és vezetési élményét fokozó Vogtland állítható magasságú futómű szett ideális választás. A futómű lehetőséget biztosít az ültetés mértékének személyre szabott beállítására. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát nyújtanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók biztosítják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel. A Vogtland, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. </p>  <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968115</p> </div>', 'Vogtland Audi A4 (Typ: B8) Avant, kivéve elektronikus lengéscsillapító szabályzással szerelt, 2008.04-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-avant-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-2008-04-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(182, '', '<div> <p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2008-tól</li> 	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Avant, 2WD, Quattro, beleértve S4, RS4, kivéve elektronikus lengéscsillapító</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: (több mint 1080 kg) 1180 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF77-78_1398-11.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF77-78_1398-11.pdf</a></li> </ul>  <p>Az autó megjelenése és vezetési élménye is javul ezzel a futómű szettel. Az ültetés mértékét szabadon állíthatja az igényei szerint. Ez a futómű szett kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, amelyek optimális komfortot és dinamikát biztosítanak a alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, amelyek más típusú futóművel rendelkeznek.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968116</p> </div>', 'Vogtland Audi A4 (Typ: B8) Avant, beleértve S4 és RS4, kivéve elektronikus lengéscsillapító szabályzással szerelt, 2008.04-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-avant-beleertve-s4-es-rs4-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-2008-04-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(183, '', '<div> <p><strong>Vogtland</strong> általános futómű állítható szettje az AUDI A4 modellekhez</p>  <ul> 	<li><strong>Évjárat</strong>: 2007.11-től</li> 	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Lim. / Sedan, 2WD, Quattro, kivéve azokat a modelleket, amelyek elektronikus lengéscsillapító szabályzással vannak felszerelve</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1080 kg) 1225 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf</a></li> </ul>  <p>A Vogtland futómű készlet nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. Lehetőség van az ültetés magasságának szabályozására az egyéni igényeknek megfelelően. Ez a kiváló minőségű futómű készlet speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó, akinek több mint 100 éves tapasztalata van a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A készlet alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyekhez szintezős vagy torziós futóművet szereltek fel.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968114</p> </div>', 'Vogtland Audi A4 (Typ: B8) Sedan, kivéve elektronikus lengéscsillapító szabályzással szerelt, 2007.11-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-sedan-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-11-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(184, '', '<div><div><strong>Audi A4 (B8) AP állítható magasságú sport futómű</strong></div> <div> </div> <div>Tartalmazza a Quattro-t</div> <div> </div> <div>Ülésmagasság elöl: 20 - 40 mm</div> <div>Ülésmagasság hátul: 15 - 40 mm</div> <div> </div> <div>Elülső tengely terhelése: 1080 kg alatt</div> <div> </div> <div>Az termék rendelkezik TÜV engedéllyel!</div></div>', 'AP made by KW Audi A4 (Typ: B8) Sedan, 2007.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b8-sedan-2007-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(185, '', '<div> <div><strong>Audi A4 (B8) AP állítható magasságú sport futómű</strong></div>  <div> </div>  <div>Tartalmazza a Quattro-t</div>  <div> </div>  <div>Elülső ültetés mértéke: 20 - 40 mm</div>  <div>Hátsó ültetés mértéke: 15 - 40 mm</div>  <div> </div>  <div>Elülső tengely terhelése: 1080 kg alatt</div>  <div> </div>  <div>Az termék rendelkezik TÜV engedéllyel!</div> </div>', 'AP made by KW Audi A4 (Typ: B8) Avant, 2008.04-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b8-avant-2008-04-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(186, '', '<div> <div><strong>Audi A4 (B8) AP állítható magasságú sport futómű</strong></div>  <div> </div>  <div>Tartalmazza Quattro rendszert</div>  <div> </div>  <div>Elülső ültetési tartomány: 20 - 40 mm</div>  <div>Hátsó ültetési tartomány: 15 - 40 mm</div>  <div> </div>  <div>Elülső tengely maximális terhelése: 1080 kg felett</div>  <div> </div>  <div>Ez a termék rendelkezik TÜV engedéllyel!</div> </div>', 'AP made by KW Audi A4 (Typ: B8) Avant, beleértve S4 és RS4, 2008.04-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b8-avant-beleertve-s4-es-rs4-2008-04-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(187, '', '<div><div><strong>Audi A4 (B8) AP állítható magasságú sport futómű</strong></div>  <div>&nbsp;</div>  <div>Tartalmazza a Quattro rendszert</div>  <div>&nbsp;</div>  <div>Elülső ültetési mérték: 20 - 40 mm</div>  <div>Hátsó ültetési mérték: 15 - 40 mm</div>  <div>&nbsp;</div>  <div>Elülső tengely terhelhetősége: 1080 kg felett</div>  <div>&nbsp;</div>  <div>Az árucikk rendelkezik TÜV engedéllyel!</div></div>', 'AP made by KW Audi A4 (Typ: B8) Sedan, beleértve S4, 2007.11-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b8-sedan-beleertve-s4-2007-11-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(188, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás az Audi A4 típushoz, amelyet 2007.11-től gyártanak. A futómű beállításával 25-55 mm-re csökkentheted az ülésmagasságot, és 25-50 mm-re az ülés magasságát. Ez a futómű kifejezetten tervezett Audi A4, Typ 8K (B8) Limousine / Sedan, 2WD, Quattro modellekhez, de figyelmeztetünk, hogy az elektronikusan szabályozott futóműveknél a deaktiváló szettet be kell építeni a csomag részeként. Az elülső tengely maximális terhelése 1080 kg, míg a hátsóé 1215 kg. A futómű engedélyezett és minősített a megfelelő szabványoknak megfelelően. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autóknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. A Vogtland futóművek német minőségű termékek, amelyek hozzájárulnak az autó megjelenésének javításához és a vezetési élmény fokozásához.</p>\n\n<p>A Vogtland futóművek kiváló választások, amelyek kombinálják a minőséget és a teljesítményt, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A kiegyensúlyozott komfort és a dinamikus vezethetőség érdekében a futóművek speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaznak, amelyek alacsony nyomású gázrendszerrel rendelkeznek. Ezek a lengéscsillapítók korrózióvédelemmel rendelkeznek, és a Vogtland futóművek TÜV minősítéssel büszkélkedhetnek. Ne feledd, hogy a termék a híres \"Made in Germany\" minőséget képviseli, és a cikkszám: 968163.</p>', 'Vogtland Audi A4 (Typ: B8) Sedan, csak elektronikus lengéscsillapító szabályzással szerelt, 2007.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-sedan-csak-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(189, '', '<p><strong>Vogtland</strong> állítható magasságú futómű szett: AUDI A4</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2008.04-től</li>\n	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li>\n	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Avant, 2WD, Quattro</li>\n	<li>Elektronikusan szabályozható futóművel szerelt típusokhoz (a deaktiváló szettet a csomag tartalmazza!)</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: (maximum) 1080 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1215 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF77-78_1398-11.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF77-78_1398-11.pdf</a></li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. Az első osztályú korrózióvédelemmel rendelkező lengéscsillapítók garantálják a tartósságot.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968165</p>', 'Vogtland Audi A4 (Typ: B8) Avant, csak elektronikus lengéscsillapító szabályzással szerelt, 2008.04-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-avant-csak-elektronikus-lengescsillapito-szabalyzassal-szerelt-2008-04-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(190, '', '<p>A Vogtland által készített állítható magasságú futómű szett az Audi A4 modellekhez ideális választás. Ez a futómű kiválóan javítja az autó megjelenését és biztosítja a maximális vezetési élményt. A futómű ültetési mértéke 25-55 mm között állítható, és olyan típusokhoz ajánlott, mint az Audi A4, Typ 8K (B8) Avant, 2WD, Quattro és S4.\n\nEz a minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is kiváló teljesítményt nyújtanak.\n\nA termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.\n\nNe hagyd ki ezt a Made in Germany minőségű terméket, melynek cikkszáma: 968166.</p>', 'Vogtland Audi A4 (Typ: B8) Avant, csak elektronikus lengéscsillapító szabályzással szerelt, beleértve S4, 2008.04-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-avant-csak-elektronikus-lengescsillapito-szabalyzassal-szerelt-beleertve-s4-2008-04-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(191, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten az Audi A4 modellekhez lett tervezve, az 2007.11-es évtől kezdve. Az ültetés mértéke 25-55 mm elöl és 25-50 mm hátul. Ez a speciális futómű szett ideális választás az Audi A4, Typ 8K (B8) Limousine / Sedan modellekhez, legyen az 2WD vagy Quattro, beleértve a S4 változatot is.</p>  <p>A futómű elektronikusan szabályozható típusokhoz való szereléshez a csomag tartalmazza a deaktiváló szettet. A maximális tengelyterhelés elől 1225 kg, míg hátul 1215 kg.</p>  <p>Ez a minőségi futómű szett kizárólag magas teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Az termék Made in Germany!</p>  <p>Cikkszám: 968164</p> ', 'Vogtland Audi A4 (Typ: B8) Sedan, csak elektronikus lengéscsillapító szabályzással szerelt, beleértve S4, 2007.11-től, (első tengely terhelés 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b8-sedan-csak-elektronikus-lengescsillapito-szabalyzassal-szerelt-beleertve-s4-2007-11-tol-els-tengely-terheles-1080kg-folott-allithato-magassagu-futomu'),
(192, '', '<div>\n  <p>Ez a JOM BlueLine Állítható magasságú futómű tökéletes választás az alábbi autótípushoz:</p>\n  <ul>\n    <li>Audi S4 (Typ: B9) Sedan</li>\n    <li>Tipuskód: B9</li>\n    <li>Évjárat: 2015-től</li>\n    <li>Szárátmérő: 48,6 / 53mm (a persely az 53mm-es csonkálványhoz tartozik)</li>\n    <li>Tengelyterhelés elöl (kg): 1215</li>\n    <li>Tengelyterhelés hátul (kg): 1200</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműrendszer rendelkezik német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedély által meghatározott ültetési lehetőségek: elöl 30-60mm, hátul 30-65mm között állítható<br />(A futómű nagyobb tartományban is állítható, azonban a TÜV engedély csak az említett értékekre vonatkozik.)</li>\n  </ul>\n  <ul>\n    <li>Gyártó: JOM Németországban</li>\n  </ul>\n  <p><strong>Cikkszám: </strong>741225</p>\n  <p><br />Az ár egy szettre vonatkozik!</p>\n  <p>A JOM Blueline Állítható magasságú futóműszett kiváló minőségű, autóspecifikus alkatrészekből áll össze.</p>\n  <p>A magasság könnyedén állítható az egyéni igényeknek megfelelően a fenti paraméterek között.</p>\n  <p>A rugókeménység és a csillapítás egységes marad a beállítási tartomány teljes hosszában.</p>\n  <p>Kiemelkedő kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>\n</div>', 'Jom Bochum Audi S4 (Typ: B9) Sedan, kivéve és elektronikus futómű szabályzással szerelt, 2015-től, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-s4-typ-b9-sedan-kiveve-es-elektronikus-futomu-szabalyzassal-szerelt-2015-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(193, '', '<p>Ez a JOM BlueLine Állítható magasságú futómű ideális választás az alábbi autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Audi A4 (Típus: B9) Avant Quattro</li>\\r\\n	<li>Típuskód: B9</li>\\r\\n	<li>Évjárat: 2015-től</li>\\r\\n	<li>Szárátmérő: 48,6 / 53mm (a csomag tartalmazza a 53mm-es csonkálványhoz szükséges perselyt)</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1215</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1265</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműkészlet rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>A TÜV engedély által előírt ültetési tartomány elöl: 30-60mm, hátul: 30-65mm között állítható<br />\\r\\n	(A futómű szinte minden esetben ennél nagyobb intervallumban állítható, azonban a TÜV engedély kizárólag a fent említett beállításokra vonatkozik.)</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>JOM termék - Made In Germany</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: </strong>741226</p>\\r\\n\\r\\n<p><br />\\r\\nAz ár egy szettre vonatkozik!</p>\\r\\n\\r\\n<p>A JOM BlueLine Állítható magasságú futóműszett kiváló minőségű, autóspecifikus alkatrészekből áll össze.</p>\\r\\n\\r\\n<p>A magasság beállítása egyénileg szabályozható a fent említett paraméterek között.</p>\\r\\n\\r\\n<p>A rugókeménység és a csillapítás mértéke az egész beállítási tartományban azonos.</p>\\r\\n\\r\\n<p>Kiemelkedően nagy kanyarstabilitást biztosít, mivel nagyon ellenáll a keresztirányú erőknek.</p>', 'Jom Bochum Audi A4 (Typ: B9) Avant Quattro, kivéve elektronikus futómű szabályzással szerelt, 2015-től, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b9-avant-quattro-kiveve-elektronikus-futomu-szabalyzassal-szerelt-2015-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(194, '', '<div>\n    <p>Ez a JOM BlueLine Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n    <ul>\n        <li>Audi A4 (Típus: B9) Sedan és Avant</li>\n        <li>Kivéve: Quattro</li>\n        <li>Tipuskód: B9</li>\n        <li>Évjárat: 2015-től</li>\n        <li>Szárátmérő: 48,6 / 53mm (a készlet tartalmazza a perselyt az 53mm-es csonkálványhoz)</li>\n        <li>Tengelyterhelés elöl (kg): 1215</li>\n        <li>Tengelyterhelés hátul (kg): 1200</li>\n    </ul>\n    <ul>\n        <li>Ez az állítható futómű német nyelvű TÜV engedéllyel rendelkezik!</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60mm, hátul: 30-65mm között módosítható</li>\n    </ul>\n    <ul>\n        <li>Gyártó: JOM Németországban</li>\n    </ul>\n    <p><strong>Cikkszám:</strong> 741223</p>\n    <p><br />Az ár 1 szettre vonatkozik!</p>\n    <p>A JOM BlueLine Állítható magasságú futóműszett prémium minőségű autó-specifikus alkatrészekből áll.</p>\n    <p>A magasság beállítása egyénileg szabályozható az előzőleg felsorolt paraméterek között.</p>\n    <p>A rugó keménysége és a csillapítás mértéke egyenletes marad a teljes beállítási tartományban.</p>\n    <p>Kiemelkedően nagy kanyarstabilitást biztosít a futómű, mivel rendkívül ellenáll a keresztirányú erőknek.</p>\n</div>', 'Jom Bochum Audi A4 (Typ: B9) Sedan és Avant, kivéve Quattro és elektronikus futómű szabályzással szerelt, 2015-től, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a4-typ-b9-sedan-es-avant-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-szerelt-2015-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(195, '', '<p><strong>Audi A4 B9 MTS-Technik Street</strong> sport futómű</p>\n<ul>\n	<li><strong>Audi A4 (Typ: B9) Sedan</strong>, 1.4TFSI / 35TFSI Mild Hybrid / 2.0TFSI / 40TFSI Mild Hybrid / 45TFSI Mild Hybrid / 45TFSI Mild Hybrid quattro / 2.0TFSI / 2.0TFSI quattro / 2.0TFSI Mild Hybrid / S4 quattro / 2.0TDI / 2.0TDI quattro / 30TDI / 30TDI Mild Hybrid / 35TDI / 35TDI Mild Hybrid</li>\n	<li><strong>Audi A4 (Typ: B9) Avant</strong>, 1.4TFSI / 35TFSI Mild Hybrid / 2.0TFSI g-tron / 40TFSI g-tron / 2.0TFSI / 2.0TFSI quattro / 40TFSI Mild Hybrid / 40TFSI Mild Hybrid quattro / 45TFSI Mild Hybrid / 45TFSI Mild Hybrid quattro / 2.0TFSI Mild Hybrid / S4 quattro / RS4 quattro / 2.0TDI / 2.0TD</li>\n	<li>Kivéve elektronikus futómű szabályzással szerelt típusok</li>\n	<li><strong>Szárátmérő (első): 48,5mm</strong></li>\n	<li>Első tengely terhelés: 1146 - 1240 kg</li>\n	<li>Hátsó tengely terhelés: 1216 - 1265 kg</li>\n	<li>Ültetés mértéke elől: 0 - 45 mm</li>\n	<li>Ültetés mértéke hátul: 10 - 55 mm</li>\n	<li>Rugó erősség (első, fő rugó): 100 N/mm</li>\n	<li>Rugó erősség (első, segély rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 100 - 120 N/mm</li>\n	<li>TÜV engedéllyel NEM rendelkezik! Engedélyezése folyamatban!</li>\n</ul>\n<p>Az MTS-Technik Street sport futóművei ideális választás azoknak, akiknek fontos a kiváló minőség és az megfizethető ár. A magasság könnyedén állítható az útviszonyoknak megfelelően, így az autó hasmagassága könnyedén beállítható. Az MTS-Technik futóművei kiváló összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az Eibach gyártja a futóművek rugóit</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>ideális egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n<p><u>Termék karakterisztika:</u></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi A4 (Typ: B9) Sedan és Avant, beleértve Quattro, 2015.08-tól, 48,5mm szárátmérő, (első tengely terhelés 1146-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b9-sedan-es-avant-beleertve-quattro-2015-08-tol-485mm-szaratmer-els-tengely-terheles-1146-1240kg-street-series-allithato-magassagu-futomu'),
(196, '', '<p><strong>Audi A4 B9 MTS-Technik Street állítható magasságú sport futómû</strong></p>  \n<ul>  \n	<li>Az Audi A4 (Typ: B9) Sedan és Avant modellek számos motorváltozatban elérhetőek.</li>  \n	<li>Kivéve az elektronikus futóművel rendelkező típusokat.</li>  \n	<li>Az MTS-Technik állítható magasságú sport futóművei ideális választásnak bizonyulnak a minőség és ár szempontjából.</li>  \n</ul>  \n<p>Az MTS-Technik futóművei lehetővé teszik a magasság fokozatmentes beállítását, így könnyedén alkalmazkodhat az útviszonyokhoz. A rugók és a lengéscsillapítók optimális egyensúlyban vannak egymással.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A futómű rugóit az Eibach gyártja.</li>  \n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>  \n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is.</li>  \n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében.</li>  \n	<li>A futómű készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>  \n</ul>  \n<p><u>Termék karakterisztika:</u></p>  \n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  \n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Audi A4 (Typ: B9) Sedan és Avant, beleértve Quattro, 2015.08-tól, 48,5mm szárátmérő, (első tengely terhelés 1145kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b9-sedan-es-avant-beleertve-quattro-2015-08-tol-485mm-szaratmer-els-tengely-terheles-1145kg-alatt-street-series-allithato-magassagu-futomu'),
(197, '', '<strong>Audi A4 B9 MTS-Technik Street állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Audi A4 (B9 kódjelű) Sedan</strong>, számos motorváltozattal rendelhető</li>\\r\\n	<li><strong>Audi A4 (B9 kódjelű) Avant</strong>, változatos motorválasztékkal érhető el</li>\\r\\n	<li>Nem kompatibilis az elektronikus futóműszabályzással rendelkező modellekkel</li>\\r\\n	<li><strong>Szárátmérő (elülső): 53 mm</strong></li>\\r\\n	<li>Első tengely terhelése: legfeljebb 1145 kg</li>\\r\\n	<li>Hátsó tengely terhelése: 1216 - 1265 kg között</li>\\r\\n	<li>Elülső ülésmagasság csökkentése: 0 - 45 mm</li>\\r\\n	<li>Hátsó ülésmagasság csökkentése: 10 - 55 mm</li>\\r\\n	<li>Rugóerő (elülső, fő): 100 N/mm</li>\\r\\n	<li>Rugóerő (elülső, segéd): 20 N/mm</li>\\r\\n	<li>Rugóerő (hátsó, fő): 100 - 120 N/mm</li>\\r\\n	<li>Nem rendelkezik TÜV engedéllyel, a jóváhagyás folyamatban van</li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei kiváló választást kínálnak azoknak, akik számára fontos a minőség és az ár-érték arány. Az állítható magasság lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>A magasság legtöbb esetben 25 és 80 mm között szabadon állítható</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém körülmények között is</li>\\r\\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\\r\\n	<li>Kiváló egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termék karakterisztika:</u></p>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n\\r\\n<p><em>A weblap tartalmának és képeinek engedély nélküli másolása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Audi A4 (Typ: B9) Sedan és Avant, beleértve Quattro, 2015.08-tól, 53mm szárátmérő, (első tengely terhelés 1145kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b9-sedan-es-avant-beleertve-quattro-2015-08-tol-53mm-szaratmer-els-tengely-terheles-1145kg-alatt-street-series-allithato-magassagu-futomu'),
(198, '', '<p><strong>Audi A4 B9 MTS-Technik Street állítható magasságú sport futómû</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Audi A4 (Typ: B9) Sedan</strong>, 1.4TFSI / 35TFSI Mild Hybrid / 2.0TFSI / 40TFSI Mild Hybrid / 45TFSI Mild Hybrid / 45TFSI Mild Hybrid quattro / 2.0TFSI / 2.0TFSI quattro / 2.0TFSI Mild Hybrid / S4 quattro / 2.0TDI / 2.0TDI quattro / 30TDI / 30TDI Mild Hybrid / 35TDI / 35TDI Mild Hybrid</li>\\r\\n	<li><strong>Audi A4 (Typ: B9) Avant, </strong>1.4TFSI / 35TFSI Mild Hybrid / 2.0TFSI g-tron / 40TFSI g-tron / 2.0TFSI / 2.0TFSI quattro / 40TFSI Mild Hybrid / 40TFSI Mild Hybrid quattro / 45TFSI Mild Hybrid / 45TFSI Mild Hybrid quattro / 2.0TFSI Mild Hybrid / S4 quattro / RS4 quattro / 2.0TDI / 2.0TD</li>\\r\\n	<li>Kivéve elektronikus futómû szabályzással szerelt típusok</li>\\r\\n	<li><strong>Szárátmérõ (elsõ): 53mm</strong></li>\\r\\n	<li>Elsõ tengely terhelés: 1146 - 1240 kg</li>\\r\\n	<li>Hátsó tengely terhelés:1216 - 1265 kg</li>\\r\\n	<li>Ültetés mértéke elõl: 0 - 45 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 10 - 55 mm</li>\\r\\n	<li>Rugó erõsség (elsõ, fõ rugó): 100 N/mm</li>\\r\\n	<li>Rugó erõsség (elsõ, segés rugó): 20 N/mm</li>\\r\\n	<li>Rugó erõsség (hátsó, fõ rugó): 100 - 120 N/mm</li>\\r\\n	<li>TÜV engedéllyel NEM rendelkezik! Engedélyezése folyamatban!</li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azok számára, akik számára fontos a kiváló minőség és az előnyös ár! A magasság fokozatmentesen állítható az útviszonyoknak megfelelően, így könnyedén beállítható az autó hasmagassága! Az MTS-Technik futóműveinél tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li>\\r\\n	<li>gáztöltetes lengéscsillapítók</li>\\r\\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termék karakterisztika:</u></p>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Audi A4 (Typ: B9) Sedan és Avant, beleértve Quattro, 2015.08-tól, 53mm szárátmérő, (első tengely terhelés 1146-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a4-typ-b9-sedan-es-avant-beleertve-quattro-2015-08-tol-53mm-szaratmer-els-tengely-terheles-1146-1240kg-street-series-allithato-magassagu-futomu'),
(199, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás az AUDI A4 B9 SEDAN modellhez, melynek évjárata 2015.10-től kezdődik. Az ültetés mértéke 40-65 / 40-65 mm között állítható, mely megfelelő rugalmasságot és kényelmet biztosít a vezető számára. Ez a futómű kifejezetten tervezve lett az Audi A4 Sedan, Typ: B9 típushoz, kivéve a Quattro változatokat.</p> <p>Az első lengéscsillapító szár átmérője 50 mm, míg a maximális tengelyterhelés elöl 1135 kg, hátul pedig 1090 kg lehet. Ennek a minőségi futómű szetnek az előnye, hogy speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak.</p> <p>A futómű korrózióvédelemmel ellátott, és bár nem rendelkezik TÜV minősítéssel, a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>A Vogtland futóművek Made in Germany minőségű termékek!</p>', 'Vogtland Audi A4 (Typ: B9) Sedan, kivéve Quattro, 2015.10-től, (első tengely terhelés 1135kg alatt), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b9-sedan-kiveve-quattro-2015-10-tol-els-tengely-terheles-1135kg-alatt-50mm-szaratmervel-allithato-magassagu-futomu'),
(200, '', '<p>A Vogtland állítható magasságú futómű szett az Audi A4 B9 AVANT típusú autókhoz készült. Az évjárat 2015.10-től lehet, és az ültetés mértéke 30-55 / 35-60 mm lehet. Ez a minőségi futómű szett kizárólag Quattro típusú Audi A4 Avant autókhoz alkalmas. A szett tartalmazza az első lengéscsillapító szár átmérőjét, ami 48,5 mm. Az első tengelyterhelés maximuma 1215 kg, míg a hátsó tengelyterhelés maximuma 1265 kg lehet.</p>\n<p>A Vogtland futómű nemcsak javítja az autó megjelenését, hanapság a vezetési élményt is maximalizálja. A beállítás lehetőségének köszönhetően az ültetés mértékét az egyéni igényeknek megfelelően lehet szabályozni. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, ami kiegyensúlyozott komfortot és fokozott dinamikát biztosít. A lengéscsillapítók korrózióvédelme kiváló minőségű.</p>\n<p>A termék nem rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugókészítés területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. Általában a szett 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintező vagy torziós futómű van beépítve.</p>\n<p>Made in Germany!</p>', 'Vogtland Audi A4 (Typ: B9) Avant Quattro, 2015.10-től, (első tengely terhelés 1215kg alatt), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b9-avant-quattro-2015-10-tol-els-tengely-terheles-1215kg-alatt-485mm-szaratmervel-allithato-magassagu-futomu'),
(201, '', '<p>A Vogtland által készített állítható magasságú futómű szett kifejezetten az Audi A4 B9 Sedan típushoz lett tervezve. Az évjárat 2015. októbertől kezdődik, és a futómű ültetési mértéke 30-55 mm elöl és 35-60 mm hátul. Ez a kiváló minőségű futómű szett kizárólag a Quattro változathoz készült. Az első lengéscsillapító szár átmérője 50 mm, míg az elöl maximális tengelyterhelés 1215 kg, a hátul pedig 1200 kg.</p>\n\n<p>Ez a futómű nemcsak esztétikailag javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. A futómű ültetését az egyéni igényeknek megfelelően lehet beállítani. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n\n<p>A termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet szereltek fel.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Audi A4 (Typ: B9) Sedan Quattro, 2015.10-től, (első tengely terhelés 1215kg alatt), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b9-sedan-quattro-2015-10-tol-els-tengely-terheles-1215kg-alatt-50mm-szaratmervel-allithato-magassagu-futomu'),
(202, '', '<p><strong>Vogtland</strong> által készített állítható magasságú futómű szett az AUDI A4 B9 SEDAN modellhez</p>  \n<ul> 	\n<li><strong>Évjárat</strong>: 2015.10-től</li> 	\n<li><strong>Ültetés mértéke</strong>: 30-55 / 35-60 mm</li> 	\n<li><strong>Típus</strong>: Audi A4 Sedan, Typ: B9, csak Quattro</li> 	\n<li><strong>Első lengéscsillapító szár átmérője: </strong>48,5mm</li> 	\n<li><strong>Max. tengelyterhelés elöl</strong>: 1215 kg</li> 	\n<li><strong>Max. tengelyterhelés hátul</strong>: 1200 kg</li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a tartóssághoz.</p>  \n<p>A termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  \n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>  \n<p>Gyártva Németországban!</p>  ', 'Vogtland Audi A4 (Typ: B9) Sedan Quattro, 2015.10-től, (első tengely terhelés 1215kg alatt), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b9-sedan-quattro-2015-10-tol-els-tengely-terheles-1215kg-alatt-485mm-szaratmervel-allithato-magassagu-futomu'),
(203, '', '<p>Vogtland állítható magasságú futómű készlet: AUDI A4 B9 AVANT</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2015.10-től</li>\n	<li><strong>Ültetés mértéke</strong>: 30-55 / 35-60 mm</li>\n	<li><strong>Típus</strong>: Audi A4 Avant, Typ: B9, csak Quattro</li>\n	<li><strong>Első lengéscsillapító szár átmérő: </strong>50mm</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1215 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1265 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett maximális vezetési élményt nyújt. Az ültetés mértéke szabadon állítható az egyéni igényeknek megfelelően. Ez a kiváló minőségű futómű készlet kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamizmust. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A készlet alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező- vagy torziós futóművet alkalmaznak.</p>\n<p>Gyártva Németországban!</p>', 'Vogtland Audi A4 (Typ: B9) Avant Quattro, 2015.10-től, (első tengely terhelés 1215kg alatt), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b9-avant-quattro-2015-10-tol-els-tengely-terheles-1215kg-alatt-50mm-szaratmervel-allithato-magassagu-futomu'),
(204, '', '<p>A Vogtland állítható magasságú futómű szett megfelelő értékek között állítható ültetés mértékével és nagy teljesítményű kétcsöves lengéscsillapítókkal javítja az autó megjelenését és biztosítja a maximális vezetési élményt. A speciális futómű szett alacsony nyomású gázrendszerrel rendelkező lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó kiváló teljesítményéhez.</p>\n\n<p>A Vogtland futómű szett nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Audi A4 (Typ: B9) Sedan, kivéve Quattro, 2015.10-től, (első tengely terhelés 1135kg alatt), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'vogtland-audi-a4-typ-b9-sedan-kiveve-quattro-2015-10-tol-els-tengely-terheles-1135kg-alatt-485mm-szaratmervel-allithato-magassagu-futomu'),
(205, '', 'Ez az állítható magasságú futómű kompatibilis az alábbi autótípussal:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Audi A4 B9 Avant Quattro</li>\\r\\n	<li>Tipuskód: B9</li>\\r\\n	<li>Évjárat: 2015.10-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1135</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1265</li>\\r\\n	<li>Szárátmérő: 50mm</li>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban változtatható a futómű magassága, azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\\r\\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Audi A4 (Typ: B9) Avant Quattro, 2015.10-től, (első tengely terhelés 1135kg alatt), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-avant-quattro-2015-10-tol-els-tengely-terheles-1135kg-alatt-50mm-szaratmervel-allithato-magassagu-futomu'),
(206, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>Audi A4 B9 Avant, 2WD</li>\n	<li>Tipuskód: B9</li>\n	<li>Évjárat: 2015.10-től</li>\n	<li>Tengelyterhelés elöl (kg): 1145</li>\n	<li>Tengelyterhelés hátul (kg): 1200</li>\n	<li>Szárátmérő: 48,5mm</li>\n	<li>Kivéve: Quattro, G-Tron</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>', 'AP made by KW Audi A4 (Typ: B9) Avant, kivéve Quattro, G-Tron, 2015.10-től, (első tengely terhelés 1145kg alatt), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-avant-kiveve-quattro-g-tron-2015-10-tol-els-tengely-terheles-1145kg-alatt-485mm-szaratmervel-allithato-magassagu-futomu'),
(207, '', 'Ez az AP-Fahrwerke Állítható magasságú futómű tökéletes választás az alábbi autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Audi A4 B9 Avant, 2WD</li>\\r\\n	<li>Tipuskód: B9</li>\\r\\n	<li>Évjárat: 2015.10-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1145</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1200</li>\\r\\n	<li>Szárátmérő: 50mm</li>\\r\\n	<li>Kivéve: Quattro, G-Tron</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futómű Németországban gyártott, és rendelkezik Német nyelvű TÜV engedéllyel.</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke az elülső és hátsó futómű esetében 40-65 mm között állítható,<br />\\r\\n	azonban ennél nagyobb intervallumban is testreszabható. Fontos, hogy a TÜV engedély kizárólag a fent említett beállításokra vonatkozik.</li>\\r\\n	<li>A termék 2 év garanciával rendelkezik, és a gyártója az Ap-Fahrwerke.</li>\\r\\n</ul>\\r\\n', 'AP made by KW Audi A4 (Typ: B9) Avant, kivéve Quattro, G-Tron, 2015.10-től, (első tengely terhelés 1145kg alatt), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-avant-kiveve-quattro-g-tron-2015-10-tol-els-tengely-terheles-1145kg-alatt-50mm-szaratmervel-allithato-magassagu-futomu'),
(208, '', '<p>Ez a járműállvány állítható magasságú futóművet biztosít az alábbi autótípushoz:</p>\n\n<p> </p>\n\n<ul>\n	<li>Audi A4 B9 Sedan, 2WD</li>\n	<li>Tipuskód: B9</li>\n	<li>Évjárat: 2015.10-től</li>\n	<li>Tengelyterhelés elöl (kg): 1135</li>\n	<li>Tengelyterhelés hátul (kg): 1090</li>\n	<li>Szárátmérő: 48,5mm</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedély által meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban lehetséges a futómű beállítása, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Készült Ap-Fahrwerke Németországban</li>\n	<li>2 éves garancia vonatkozik erre a termékre</li>\n</ul>', 'AP made by KW Audi A4 (Typ: B9) Sedan, kivéve Quattro, 2015.10-től, (első tengely terhelés 1135kg alatt), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-sedan-kiveve-quattro-2015-10-tol-els-tengely-terheles-1135kg-alatt-485mm-szaratmervel-allithato-magassagu-futomu'),
(209, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futóművet a következő Audi A4 B9 Avant Quattro típusba ajánljuk:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Modellszám: B9</li>\\r\\n	<li>Gyártási év: 2015.10-től</li>\\r\\n	<li>Elülső tengelyterhelés: 1135 kg</li>\\r\\n	<li>Hátsó tengelyterhelés: 1265 kg</li>\\r\\n	<li>Szárrátmérő: 48,5mm</li>\\r\\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\\r\\n	<li>Az ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n	<li>Gyártás helye: Ap-Fahrwerke Németország</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Audi A4 (Typ: B9) Avant Quattro, 2015.10-től, (első tengely terhelés 1135kg alatt), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-avant-quattro-2015-10-tol-els-tengely-terheles-1135kg-alatt-485mm-szaratmervel-allithato-magassagu-futomu'),
(210, '', '<div>\n	<p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómû</strong> alkalmas az alábbi autótípusra:</p>\n	<ul>\n		<li>Audi A4 B9 Avant Quattro</li>\n		<li>Tipuskód: B9</li>\n		<li>Évjárat: 2015.10-tõl</li>\n		<li>Tengelyterhelés elöl (kg): 1136-1215</li>\n		<li>Tengelyterhelés hátul (kg): 1265</li>\n		<li>Szárátmérõ: 50mm</li>\n		<li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li>\n		<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />(Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n		<li>Made In Ap-Fahrwerke Németország</li>\n		<li>Garancia erre a termékre: 2 év</li>\n	</ul>\n</div>', 'AP made by KW Audi A4 (Typ: B9) Avant Quattro, 2015.10-től, (első tengely terhelés 1136-1215), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-avant-quattro-2015-10-tol-els-tengely-terheles-1136-1215-50mm-szaratmervel-allithato-magassagu-futomu'),
(211, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Audi A4 B9 Sedan, 2WD</li>\\r\\n	<li>Tipuskód: B9</li>\\r\\n	<li>Évjárat: 2015.10-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1135</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1090</li>\\r\\n	<li>Szárátmérő: 50mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez az állítható futómű Német nyelvű TÜV engedéllyel rendelkezik!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban beállítható a futómű, azonban a TÜV engedély kizárólag a fent említett beállításokra vonatkozik.)</li>\\r\\n	<li>Gyártva Ap-Fahrwerke Németországban</li>\\r\\n	<li>Garancia e termékre: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Audi A4 (Typ: B9) Sedan, kivéve Quattro, 2015.10-től, (első tengely terhelés 1135kg alatt), 50mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-sedan-kiveve-quattro-2015-10-tol-els-tengely-terheles-1135kg-alatt-50mm-szaratmervel-allithato-magassagu-futomu'),
(212, '', '<p>Ez az állítható magasságú AP-Fahrwerke futómű kompatibilis az alábbi autótípusokkal:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Audi A4 B9 Avant Quattro</li>\\r\\n	<li>Tipuskód: B9</li>\\r\\n	<li>Évjárat: 2015.10-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1136-1215</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1265</li>\\r\\n	<li>Szárátmérő: 48,5mm</li>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\\r\\n	(Ezen intervallumokon belül állítható a futómű, azonban a TÜV engedély kizárólag ezekre vonatkozik.)</li>\\r\\n	<li>Gyártó: Ap-Fahrwerke Németország</li>\\r\\n	<li>Garancia: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Audi A4 (Typ: B9) Avant Quattro, 2015.10-től, (első tengely terhelés 1136-1215), 48,5mm szárátmérővel állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a4-typ-b9-avant-quattro-2015-10-tol-els-tengely-terheles-1136-1215-485mm-szaratmervel-allithato-magassagu-futomu'),
(213, '', '<p>Az Eibach Pro-Street S állítható magasságú tuning sport futómű olyan termék, amely a motorsport világából szerzett tapasztalatokra épít. Legyen szó hétvégi versenyzésről vagy hétköznapi közlekedésről, ez a futómű a legjobb megoldást nyújtja. A Pro-Street lengéscsillapítók nemesacél technológiával készülnek, hogy garantálják a sportos megjelenést és kiváló minőséget. A magasságállítás korrózióállóságát a polyamidból készült rugótányérok biztosítják. A fejlesztési ismeretek, a minőségi anyagok és az ERS versenyrugó-program együttesen teszik a Pro-Street-S terméket csúcsminőségűvé. Ezzel a futóművel progresszívítást, sportos kényelmet, egyedi magasságbeállítást, rozsdamentes nemesacél-kivitelezést és egyszerű magasságállítást kap. A termék magasságállítási tartománya 20-70 mm, TÜV által ellenőrzött és dokumentált. A futóműben ERS versenyrugók találhatók, és csúcsminőségű lengéscsillapítók vannak világszerte piacvezető cégek által gyártva az Eibach előírásai szerint.</p>', 'Eibach Audi A4 (Typ: B9) Avant, kivéve Quattro, 2015.08-tól, 50mm szárátmérő, (első tengely terhelés 1145kg alatt), Pro-Street-S állítható magasságú futómű', '', '', '', 'eibach-audi-a4-typ-b9-avant-kiveve-quattro-2015-08-tol-50mm-szaratmer-els-tengely-terheles-1145kg-alatt-pro-street-s-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(214, '', '<p>Egy állítható magasságú sport futómű, melyet Audi A5 Jom Blueline modellhez terveztek.</p>\\r\\n\\r\\n<p>Ez a futómű kompatibilis az Audi A5 B8 Cabrio modellekkel, gyártási év: 2007.06-tól. Kivétel: S5, RS5 modellek. Kompatibilis a Quattro változatokkal is.</p>\\r\\n<p>A futómű hátsó tengelyén a magasságállító a rugó alatt található.</p>\\r\\n<p>Tengelyterhelés elöl: 1215 kg, tengelyterhelés hátul: 1240 kg.</p>\\r\\n<p>Ez a termék MADE IN GERMANY, rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n<p>1 ÉV TELJESKÖRŰ GARANCIÁVAL! Kiváló minőség, kiemelkedő ár-érték arány!</p>\\r\\n<p>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 db kulcsot az állításhoz.</p>', 'Jom Bochum Audi A5 (Typ: B8) Cabrio, beleértve Quattro, kivéve S4, RS5, 2007.06-tól, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a5-typ-b8-cabrio-beleertve-quattro-kiveve-s4-rs5-2007-06-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(215, '', '<strong>Audi A5 Jom Blueline állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>Az Audi A5 B8 Coupé és Sportback modellekhez készült sport futómű, melynek beépítési éve 2007.06-tól kezdődik. Ez a futómű nem alkalmas a Cabrio, S5 és RS5 modellekre, viszont használható Quattro modellekhez is. A futómű hátsó tengelyén található magasságállító a rugó alatt helyezkedik el, biztosítva a kiváló teljesítményt. Az elülső tengely terhelése 1215 kg, míg a hátsó tengelyé 1240 kg. A futómű minőségi termék, MADE IN GERMANY, mely rendelkezik német nyelvű TÜV engedéllyel, amit a csomagolás tartalmaz. Emellett egy teljes év garanciát is biztosítunk rá! A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal és 2 állítókulccsal, hogy könnyedén be tudja őket állítani.</p>\\r\\n', 'Jom Bochum Audi A5 (Typ: B8), beleértve Quattro, kivéve S4, RS5, Cabrio, 2007.06-tól, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a5-typ-b8-beleertve-quattro-kiveve-s4-rs5-cabrio-2007-06-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(216, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és versenyképes árakat. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy az autó hasmagassága könnyedén alkalmazkodjon az útviszonyokhoz. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és lengéscsillapítók között.</p>\n\n<p><u>Fontos jellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja.</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható.</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is.</li>\n	<li>Kettős bevonat a hosszantartó korrózióvédelem érdekében: sárga cink és fekete anodyzált alumínium alkatrészek.</li>\n	<li>A rugók és lengéscsillapítók tökéletes egyensúlya.</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A5 (Typ: B8), beleértve Quattro, 2007.06-tól, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a5-typ-b8-beleertve-quattro-2007-06-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(217, '', '<p>A MTS-Technik állítható magasságú sport futóművének kiváló választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális összhang van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach cég gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A5 (Typ: B8), beleértve Quattro, 2007.06-tól, (első tengely terhelés 1081-1245kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a5-typ-b8-beleertve-quattro-2007-06-tol-els-tengely-terheles-1081-1245kg-allithato-magassagu-futomu'),
(218, '', '<em>Az Audi A5 V-Maxx futóműve állítható magasságú és keménységű</em><br /><ul><br /><li>Az Audi A5 Cabrio modell</li><br /><li>Típus: 8K (B8)</li><br /><li>Inkluzív: Quattro összkerékhajtás</li><br /><li>Kivéve: RS5 változat</li><br /><li>Elülső ültetés mértéke: 30-65mm</li><br /><li>Hátsó ültetés mértéke: 40-65mm</li><br /><li><em>Keménység 20 fokozatban állítható!</em></li><br /><li>A termék rendelkezik TÜV engedéllyel</li><br /></ul>', 'V-Maxx Audi A5 (Typ: B8) Cabrio, beleértve Quattro, kivéve RS5, 2007.06-2017.01-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-a5-typ-b8-cabrio-beleertve-quattro-kiveve-rs5-2007-06-2017-01-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(219, '', '<em>Audi A5 V-Maxx gumiabroncs-barát futómű</em><br /><ul><br /><li>Audi A5 Kupé és Sportback változatok</li><br /><li>Modellszám: 8K (B8)</li><br /><li>Inkluzív: Quattro összkerékhajtás</li><br /><li>Kivétel: Tetős és RS5 kivitelek</li><br /><li>Elülső csökkentés: 30-65mm</li><br /><li>Hátsó csökkentés: 40-65mm</li><br /><li><em>20 különböző puhasági beállítási lehetőség!</em></li><br /><li>A termék TÜV tanúsítvánnyal rendelkezik</li><br /></ul>', 'V-Maxx Audi A5 (Typ: B8) Coupé és Sportback, beleértve Quattro, kivéve RS5, 2007.06-2017.01-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-a5-typ-b8-coupe-es-sportback-beleertve-quattro-kiveve-rs5-2007-06-2017-01-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(220, '', '<div> <p><strong>Vogtland</strong> állítható emelkedésű futómű készlet: AUDI A4</p>  <ul> 	<li><strong>Évjárat</strong>: 2007.11-től</li> 	<li><strong>Emelkedés mértéke:</strong> 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Lim. / Sedan, 2WD, Quattro, kivéve az elektronikus lengéscsillapító szabályzóval felszerelt verziókat</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (max.) 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett a termék optimális vezetési élményt kínál. Az ültetés mértékét egyénileg állíthatja be a kívánt értékekre. Ez a kiváló minőségű futómű készlet kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamizmust biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel. A több mint 100 éves tapasztalattal rendelkező gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A készlet általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968113</p> </div>  ', 'Vogtland Audi A5, S5, RS5, beleértve Quattro, kivéve elektronikus lengéscsillapító szabályzással szerelt, 2007.05-től, (első tengely terhelése 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a5-s5-rs5-beleertve-quattro-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-05-tol-els-tengely-terhelese-1080kg-alatt-allithato-magassagu-futomu'),
(221, '', '<div> <div><strong>Állítható magasságú sport futómű az Audi A4 (B8) modellhez</strong></div>  <div> </div>  <div>Tartalmazza a Quattro változatot is</div>  <div> </div>  <div>Elülső ültetés: 20 - 40 mm</div>  <div>Hátsó ültetés: 15 - 40 mm</div>  <div> </div>  <div>Elülső tengely terhelése: 1080 kg alatt</div>  <div> </div>  <div>Ez a termék rendelkezik TÜV engedéllyel!</div> </div> ', 'AP made by KW Audi A5 (Typ: 8T), beleértve S5 és RS5, 2007.06-tól, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a5-typ-8t-beleertve-s5-es-rs5-2007-06-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(222, '', '<div> <p><strong>Vogtland</strong> által állítható gépjármű futómű szett az AUDI A4 típushoz</p>  <ul> 	<li><strong>Évjárat</strong>: 2007.11-től</li> 	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Audi A4, Typ 8K (B8) Lim. / Sedan, 2WD, Quattro, kivéve az elektronikus lengéscsillapító szabályzást</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1080 kg) 1225 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf</a></li> </ul>  <p>Az autó megjelenésén javít, miközben optimális vezetési élményt biztosít. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. A futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerük révén kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak ellátva.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968114</p> </div>', 'Vogtland Audi A5, S5, RS5, beleértve Quattro, kivéve elektronikus lengéscsillapító szabályzással szerelt, 2007.05-től, (első tengely terhelése 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a5-s5-rs5-beleertve-quattro-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-05-tol-els-tengely-terhelese-1080kg-folott-allithato-magassagu-futomu'),
(223, '', '<div> <div><strong>Állítható magasságú sport futómű az Audi A4 (B8) autóhoz</strong></div>  <div> </div>  <div>Tartalmazza a Quattro rendszert</div>  <div> </div>  <div>Az ültetés módosítható elöl: 20 - 40 mm</div>  <div>Az ültetés módosítható hátul: 15 - 40 mm</div>  <div> </div>  <div>Az első tengely maximális terhelése: 1080 kg felett</div>  <div> </div>  <div>Az termék rendelkezik TÜV engedéllyel!</div> </div>', 'AP made by KW Audi A5 (Typ: 8T), beleértve S5 és RS5, 2007.06-tól, (első tengely terhelés 1081-1245kg között) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a5-typ-8t-beleertve-s5-es-rs5-2007-06-tol-els-tengely-terheles-1081-1245kg-kozott-allithato-magassagu-futomu'),
(224, '', '<p><strong>Vogtland</strong> által kifejlesztett állítható magasságú futómű szett az AUDI A5 modellekhez.</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2007.05-től</li>\n	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 25 - 50 mm</li>\n	<li><strong>Típus</strong>: Audi A5, Typ 8K (B8) Cabrio, Coupé, Sportback, 2WD, Quattro</li>\n	<li>Alkalmas elektronikusan szabályozható futóművekhez, de szükséges a deaktiváló szett használata.</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1080 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1240 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF74-75_1436-10.pdf</a></li>\n</ul>\n<p>Az autó megjelenésén javít és optimális vezetési élményt nyújt. Az ültetés mértékét szabadon állíthatja a megfelelő értékek között, és a futómű szett kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek garantálják a kiegyensúlyozott komfortérzetet és dinamikus vezetést. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók alacsony nyomású gázrendszerrel vannak ellátva.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p>Németországban készült!</p>\n<p>Cikkszám: 968168</p>', 'Vogtland Audi A5, beleértve Quattro, csak elektronikus lengéscsillapító szabályzással szerelt, 2007.05-től, (első tengely terhelése 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a5-beleertve-quattro-csak-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-05-tol-els-tengely-terhelese-1080kg-alatt-allithato-magassagu-futomu'),
(225, '', '<p>Az AUDI A5 Vogtland állítható magasságú futómű szettje ideális választás azoknak, akik szeretnék egyéni igényeik szerint beállítani autójuk megjelenését és vezetési élményét. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Emellett első osztályú korrózióvédelemmel rendelkeznek.</p>\n\n<p>A Vogtland futóművet TÜV minősítéssel látta el a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel rendelkeznek.</p>\n\n<p>Az ültetés mértéke 25-55 mm-el (elöl) és 25-50 mm-el (hátul) állítható. Kompatibilis az Audi A5 Typ 8K (B8) Cabrio, Coupé, Sportback modellekkel, beleértve a 2WD-t, Quattrot, valamint az S5 és RS5 változatokat. Elektronikusan szabályozható futóművel szerelt típusokhoz kiiktatás szükséges, a deaktiváló szettet a csomag tartalmazza.</p>\n\n<p>A maximális tengelyterhelés elől 1245 kg, míg hátul 1240 kg. A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968169</p>', 'Vogtland Audi A5, S5, RS5, beleértve Quattro, csak elektronikus lengéscsillapító szabályzással szerelt, 2007.05-től, (első tengely terhelése 1080kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a5-s5-rs5-beleertve-quattro-csak-elektronikus-lengescsillapito-szabalyzassal-szerelt-2007-05-tol-els-tengely-terhelese-1080kg-folott-allithato-magassagu-futomu'),
(226, '', '<div>\n    <p>Ez a JOM BlueLine Állítható magasságú futómű megfelel az alábbi autótípusokhoz:</p>\n    <ul>\n        <li>Audi A5 (Typ: B9) Coupé Quattro, Sportback Quattro</li>\n        <li>Tipuskód: B9</li>\n        <li>Évjárat: 2015-től</li>\n        <li>Szárátmérő: 48,6 / 53mm (a készlet tartalmazza a perselyt az 53mm-es csonkálványhoz)</li>\n        <li>Tengelyterhelés elöl (kg): 1215</li>\n        <li>Tengelyterhelés hátul (kg): 1265</li>\n    </ul>\n    <ul>\n        <li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60mm, hátul: 30-65mm között állítható (általában nagyobb intervallumban állítható, de a TÜV engedély csak a fenti beállításokkal érvényes.)</li>\n    </ul>\n    <ul>\n        <li>Gyártó: JOM, Németország</li>\n    </ul>\n    <p><strong>Cikkszám: </strong>741227</p>\n    <p><br />\n    Az ár egy szettre vonatkozik!</p>\n    <p>A JOM BlueLine Állítható magasságú futóműszett prémium autó-specifikus alkatrészekből áll.</p>\n    <p>A magasságbeállítás széles skálán módosítható az egyéni igényeknek megfelelően.</p>\n    <p>A rugó keménysége és a csillapítás mértéke az egész beállítási tartományban konzisztens marad.</p>\n    <p>Kiemelkedően nagy kanyarstabilitást biztosít a rendkívüli ellenállásnak köszönhetően a keresztirányú erőkkel szemben.</p>\n</div>', 'Jom Bochum Audi A5 (Typ: B9) Coupé és Sportback, csak Quattro, kivéve elektronikus futómű szabályzással szerelt, 2015-től, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a5-typ-b9-coupe-es-sportback-csak-quattro-kiveve-elektronikus-futomu-szabalyzassal-szerelt-2015-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(227, '', '<p>Ez a JOM BlueLine Állítható magasságú futómű illik az alábbi autótípushoz:</p>\n\n<ul>\n	<li>Audi A5 (Typ: B9) Coupé és Sportback</li>\n	<li>Kivéve: Quattro</li>\n	<li>Tipuskód: B9</li>\n	<li>Évjárat: 2015-től</li>\n	<li>Szárátmérő: 48,6 / 53mm (a készlet tartalmazza a perselyt az 53mm-es csonkálványhoz)</li>\n	<li>Tengelyterhelés elöl (kg): 1215</li>\n	<li>Tengelyterhelés hátul (kg): 1200</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60mm, hátul: 30-65mm között állítható<br />\\r\\n	(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n</ul>\n\n<ul>\n	<li>Made In JOM Németország</li>\n</ul>\n\n<p><strong>Cikkszáma: </strong>741224</p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>\n\n<p>A JOM Blueline Állítható magasságú futóműszett, kiváló minőségű autó-specifikus alkatrészekből áll.</p>\n\n<p>A magasságbeállítás egyéni igények szerint állítható a fent megadott paraméterek között.</p>\n\n<p>A rugó keménysége és a csillapítás mértéke a teljes beállítási tartományban egyenlő.</p>\n\n<p>A különlegesen nagy kanyarstabilitást biztosít, mert rendkívül ellenáll a keresztirányú erőknek.</p>', 'Jom Bochum Audi A5 (Typ: B9) Coupé és Sportback, kivéve Quattro és elektronikus futómű szabályzással szerelt, 2015-től, (első tengely terhelés 1215kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a5-typ-b9-coupe-es-sportback-kiveve-quattro-es-elektronikus-futomu-szabalyzassal-szerelt-2015-tol-els-tengely-terheles-1215kg-alatt-allithato-magassagu-futomu'),
(228, '', '<strong>Állítható Magasságú Futómű az Audi A5 típusú autókhoz</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: Audi A5 (Typ B9)</li>\\r\\n	<li>Évjárat: 2016-tól</li>\\r\\n	<li>Kizárólag Coupé modellekhez</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Lehetőség van az elülső és hátsó futómű magasságának állítására</li>\\r\\n	<li>Széles skálán változtatható a futómű magassága</li>\\r\\n	<li>Egyike a legkiemelkedőbb alap szintű, állítható futóműveknek</li>\\r\\n	<li>Kiemelkedően precízen kidolgozott</li>\\r\\n	<li>Sportos, feszes és rendkívül tartós</li>\\r\\n	<li>Javítja a kanyarstabilitást és növeli a vezetési élményt</li>\\r\\n	<li>Rendelkezik TÜV tanúsítvánnyal</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A5 (Typ: B9) Coupé, 2016.06-tól állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a5-typ-b9-coupe-2016-06-tol-allithato-magassagu-futomu'),
(229, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik a minőséget és kedvező árat értékelik. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és lengéscsillapítók optimális egyensúlyban vannak.</p>\n\n<u>A következő típusokhoz ajánlott:</u>\n\n<ul>\n	<li>Audi A6 (Typ: C4) Sedan</li>\n	<li>Audi A6 (Typ: C4) Avant</li>\n	<li>Kivéve Quattro</li>\n	<li>Ültetés mértéke elöl: 15-100mm</li>\n	<li>Ültetés mértéke hátul: 15-85mm</li>\n	<li>Első tengely terhelés: 1240kg</li>\n	<li>Hátsó tengely terhelés: 1200kg</li>\n	<li>Elöl állítható toronycsapágyakkal! (MTSCP39SET)</li>\n	<li>Hátul motorsport toronycsapágyakkal (MTSCP35SET)</li>\n	<li>TÜV engedéllyel NEM rendelkezik!</li>\n</ul>\n\n<u>MTS Technik Motorsport első állítható toronycsapágy jellemzői:</u>\n\n<ul>\n	<li>Első toronycsapágy állíthatóság: -2.5°, +0.5°</li>\n	<li>Első toronycsapágy tömege: 1100g</li>\n	<li>Hátsó toronycsapágy nem állítható</li>\n	<li>Hátsó toronycsapágy tömege: 620g</li>\n	<li>Gyári futóműhöz NEM passzol</li>\n	<li>Az MTS Technik állítható toronycsapágyak lehetővé teszik a kerék dőlés állítását</li>\n	<li>A kerék dőlés beállítása javítja az autó vezethetőségét és csökkenti a gumi kopást</li>\n	<li>Minden MTS Technik állítható toronycsapágy alumínium ötvözetből készül</li>\n	<li>Az MTS Technik toronycsapágyak CNC technológiával gyártottak</li>\n	<li>Az MTS Technik állítható toronycsapágyak kompatibilisek a legtöbb állítható magasságú futóművel</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszú élettartó korrózióvédelem érdekében</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék karakterisztika:</strong></u>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C4) Sedan és Avant, kivéve Quattro, 1994.06-1997.10-ig, Street Series, Motorsport toronycsapágyakkal állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c4-sedan-es-avant-kiveve-quattro-199406-199710-ig-street-series-motorsport-toronycsapagyakkal-allithato-magassagu-futomu'),
(230, '', '<p>Egy kiváló választás az MTS-Technik állítható magasságú sport futóműve, mely ideális kombinációja a jó minőségnek és kedvező árnak. A futómű fokozatmentesen állítható magassága könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei tökéletes összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz passzol:</u></p>\n\n<ul>\n	<li><strong>Audi A6 (Typ: C4) Sedan,</strong> 1.8 quattro / 2.0 16V quattro / 2.3 quattro / 2.5 TDI quattro / 2.6 quattro / 2.8 quattro / S6 4.2 quattro / S6 Plus quattro / S6 Turbo quattro</li>\n	<li><strong>Audi A6 (Typ: C4) Avant,</strong> 1.8 quattro / 2.0 16V quattro / 2.3 quattro / 2.5 TDI quattro / 2.6 quattro / 2.8 quattro / S6 4.2 quattro / S6 Plus quattro / S6 Turbo quattro</li>\n	<li>Csak Quattro</li>\n	<li>Ültetés mértéke elöl: 15-100mm</li>\n	<li>Ültetés mértéke hátul: 15-85mm</li>\n	<li>Első tengely terhelés: 1240kg</li>\n	<li>Hátsó tengely terhelés: 1200kg</li>\n	<li><strong>Elöl állítható toronycsapágyakkal! (MTSCP39SET)</strong></li>\n	<li><strong>Hátul motorsport toronycsapágyakkal (MTSCP35SET)</strong></li>\n	<li>TÜV engedéllyel NEM rendelkezik!</li>\n</ul>\n\n<p><u>MTS Technik Motorsport első állítható toronycsapágy jellemzői:</u></p>\n\n<ul>\n	<li>Első toronycsapágy állíthatóság: -2.5°, +0.5°</li>\n	<li>Első toronycsapágy tömege: 1100g</li>\n	<li>Hátsó toronycsapágy nem állítható</li>\n	<li>Hátsó toronycsapágy tömege: 620g</li>\n	<li>Gyári futóműhöz NEM passzol</li>\n	<li>Az MTS Technik állítható toronycsapágyak lehetővé teszik a kerék dőlés állítását</li>\n	<li>A kerék dőlésének beállítása javítja az autó vezethetőségét és csökkenti a gumi kopását</li>\n	<li>Minden MTS Technik állítható toronycsapágy alumínium ötvözetből készül</li>\n	<li>Az MTS Technik toronycsapágyak CNC technológiával gyártottak</li>\n	<li>Minden állítható toronycsapágy erősített G-szemmel rendelkezik a hosszú élettartam érdekében</li>\n	<li>Az MTS Technik állítható toronycsapágyak kompatibilisek a legtöbb állítható magasságú futóművel!</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C4) Sedan Quattro és Avant Quattro, 1994.06-1997.10-ig, Street Series, Motorsport toronycsapágyakkal állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c4-sedan-quattro-es-avant-quattro-199406-199710-ig-street-series-motorsport-toronycsapagyakkal-allithato-magassagu-futomu'),
(231, '', '<strong>Audi A6 JOM BLUE LINE állítható magasságú sport futómű első és hátsó toronycsapágyakkal</strong></p>\\r\\n\\r\\n<p>Típuskód: 4B</p>\\r\\n\\r\\n<p>Évjárat: 1998.03 - 2005.05</p>\\r\\n\\r\\n<p>Quattro típusokhoz nem megfelelő</p>\\r\\n\\r\\n<p><strong>A csomag tartalmazza az első és hátsó toronycsapágyakat!</strong></p>\\r\\n\\r\\n<p>A hátsó tengelynél a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>Tengelyterhelés elöl: 1245 kg</p>\\r\\n\\r\\n<p>Tengelyterhelés hátul: 1250 kg</p>\\r\\n\\r\\n<p>GYÁRTVA NÉMETORSZÁGBAN</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>Kiemelkedő minőség, rendkívül versenyképes áron!!!</p>\\r\\n\\r\\n<p>A szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</p>\\r\\n\\r\\n<p><strong>Jom BlueLine állítható magasságú sportfutómű</strong></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p>A BlueLine állítható magasságú futóművek magas minőséget képviselnek, minden egyes futómű típusra szabott. Az autó magassága egy állítási tartományon belül a speciális állítókulccsal könnyedén módosítható.</p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p>- 19.3 TÜV minősítéssel rendelkezik</p>\\r\\n\\r\\n<p>- EPS technológiával porfestett, valamint horganyzott alkatrészekkel</p>\\r\\n', 'Jom Bochum Audi A6 (Typ: C5), kivéve Quattro, 1998.03-2005.05-ig, Blue Line, toronycsapágyakkal állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a6-typ-c5-kiveve-quattro-1998-03-2005-05-ig-blue-line-toronycsapagyakkal-allithato-magassagu-futomu'),
(232, '', '<p><strong>Volkswagen Passat MTS-Technik Street állítható magasságú sport futómű</strong></p>\n<ul>\n	<li><strong>Volkswagen Passat 3B Sedan, </strong>1.8T syncro / 2.0 syncro / 2.3 VR5 syncro / 2.8 V6 syncro / 1.9TDI syncro / 2.5TDI syncro</li>\n	<li><strong>Volkswagen Passat 3B Variant, </strong>1.8T syncro / 2.0 syncro / 2.3 VR5 syncro / 2.8 V6 syncro / 1.9TDI syncro / 2.5TDI syncro</li>\n	<li><strong>Volkswagen Passat 3BG Sedan, </strong>1.8T 4motion / 2.0 4motion / 2.3 VR5 4motion / 2.8 V6 4motion / 1.9TDI 4motion / 2.5TDI 4motion</li>\n	<li><strong>Volkswagen Passat 3BG Variant, </strong>1.8T 4motion / 2.0 4motion / 2.3 VR5 4motion / 2.8 V6 4motion / 1.9TDI 4motion / 2.5TDI 4motion</li>\n	<li>első tengely terhelés 1201-1350kg</li>\n	<li>csak Syncro és 4-Motion modellekhez</li>\n	<li>TÜV: <a href=\"https://mtstechnik.com/data/links/6d881208cce1290eacbd4211cb277151/30360_6690.pdf\">link</a></li>\n	<li>Ültetés mértéke elől: 25-70mm</li>\n	<li>Ültetés mértéke hátul: 25-70mm</li>\n</ul>\n<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek kiváló választást jelentenek azoknak, akik számára fontos a kiváló minőség és az megfizethető ár. Az útviszonyoknak megfelelően finomhangolható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u>Termék karakterisztika:</u></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C5) Quattro, 1997.01-2004.12-ig, (első tengely terhelés 1101-1350kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c5-quattro-1997-01-2004-12-ig-els-tengely-terheles-1101-1350kg-allithato-magassagu-futomu'),
(233, '', '<p>A MTS-Technik által készített állítható magasságú sport futóművek ideális választást jelentenek azoknak, akik fontosnak tartják a kiváló minőséget és megfizethető árat. A futómű könnyedén állítható a beállításnak megfelelően, így biztosítva az optimális hasmagasságot az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók között tökéletes az egyensúly.</p> <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Rugók Eibach gyártmányúak</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Extrém igénybevétel mellett is magas hatékonyság</li> 	<li>Korrózióvédelem két rétegű bevonattal</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C5), kivéve Quattro és S6, 1998.03-2005.05-ig, (első tengely terhelés 1101-1250kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c5-kiveve-quattro-es-s6-1998-03-2005-05-ig-els-tengely-terheles-1101-1250kg-allithato-magassagu-futomu'),
(234, '', '<p>Az MTS-Technik állítható magasságú sport futóművek ideális választás lehetnek azoknak, akik számára fontos a kiváló minőség és az megfizethető ár. A magasság könnyedén beállítható a különböző útviszonyoknak megfelelően, így lehetőség van a hasmagasság finomhangolására. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li><strong>A termék rendelkezik TÜV engedéllyel</strong></li> 	<li>A magasság széles határok között állítható, általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C5), kivéve Quattro és S6, 1998.03-2005.05-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c5-kiveve-quattro-es-s6-1998-03-2005-05-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(235, '', '<p><strong>Volkswagen Passat MTS-Technik Street állítható magasságú sport futómű</strong></p>\n\n<ul>\n	<li><strong>Volkswagen Passat 3B Sedan, </strong>1.8T syncro / 2.0 syncro / 2.3 VR5 syncro / 2.8 V6 syncro / 1.9TDI syncro / 2.5TDI syncro</li>\n	<li><strong>Volkswagen Passat 3B Variant, </strong>1.8T syncro / 2.0 syncro / 2.3 VR5 syncro / 2.8 V6 syncro / 1.9TDI syncro / 2.5TDI syncro</li>\n	<li><strong>Volkswagen Passat 3BG Sedan, </strong>1.8T 4motion / 2.0 4motion / 2.3 VR5 4motion / 2.8 V6 4motion / 1.9TDI 4motion / 2.5TDI 4motion</li>\n	<li><strong>Volkswagen Passat 3BG Variant, </strong>1.8T 4motion / 2.0 4motion / 2.3 VR5 4motion / 2.8 V6 4motion / 1.9TDI 4motion / 2.5TDI 4motion</li>\n	<li>első tengely terhelés 1200kg alatt</li>\n	<li>csak Syncro és 4-Motion modellekhez</li>\n	<li>Ültetés mértéke elől: 25-70mm</li>\n	<li>Ültetés mértéke hátul: 25-70mm</li>\n</ul>\n\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei optimális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém igénybevételek esetén is</li>\n	<li>két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>ideális egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem szükséges módosítás az autó felfüggesztésén</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A6 (Typ: C5) Quattro, 1997.01-2004.12-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-c5-quattro-1997-01-2004-12-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(236, '', '<div>\\nAz Audi A6 C5 V-Maxx futóműve testreszabható magasságú és keménységű, tökéletes sportoláshoz.\\n</div>', 'V-Maxx Audi A6 (Typ: C5), kivéve Quattro, 1998.03-2005.05-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-a6-typ-c5-kiveve-quattro-1998-03-2005-05-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(237, '', '<div> <p>Ez a AP-Fahrwerke Állítható magasságú futómû megfelel az alábbi autótípusnak:</p>  <ul> 	<li>Audi A6 Limousine, Avant, Quattro, S6</li> 	<li>Tipuskód: 4B</li> 	<li>Típus variáció: Quattro</li> 	<li>Évjárat: 1997.02-tõl</li> 	<li>Tengelyterhelés elöl (kg): 1350</li> 	<li>Tengelyterhelés hátul (kg): 1300</li> 	<li>Egyéb kitételek: Kivéve automata szintszabályzóval ellátott vagy automata szintszabályzóval beépíthetõ modellek.<br /> 	Az ültetés mértéke csökkenhet a gyárilag sportfutómûvel rendelkezõ modelleknél.<br /> 	Csak összkerékmeghajtású modellekhez (4x4, 4Motion, Quattro stb.)!</li> </ul>  <ul> 	<li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li> 	<li>A TÜV engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetõség elöl: +50 mm, hátul: +25 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-026</strong></p> </div> ', 'AP made by KW Audi A6 (Typ: 4B) Sedan, Avant, csak Quattro, 1997.02-től, (első tengely terhelés 1101-1260kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4b-sedan-avant-csak-quattro-1997-02-tol-els-tengely-terheles-1101-1260kg-ig-allithato-magassagu-futomu'),
(238, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû az alábbi autótípushoz illeszkedik:</p>  <ul> 	<li>Audi A6 Limousine, Avant, Első kerék hajtás</li> 	<li>Tipuskód: 4B</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1997.01-től</li> 	<li>Tengelyterhelés elöl (kg): 1250</li> 	<li>Tengelyterhelés hátul (kg): 1185</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!</li> </ul>  <ul> 	<li>Ez a futómű összeállítás rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plusz ültetés lehetőség elöl: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>Garancia erre a termékre: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-011</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div> ', 'AP made by KW Audi A6 (Typ: 4B) Sedan, Avant, kivéve Quattro, 1997.02-től, (első tengely terhelés 1101-1250kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4b-sedan-avant-kiveve-quattro-1997-02-tol-els-tengely-terheles-1101-1250kg-ig-allithato-magassagu-futomu'),
(239, '', '<div> <p>Ez az állítható magasságú AP-Fahrwerke futóművet az alábbi Audi A6 típusokhoz tervezték:</p>  <ul> 	<li>Audi A6 Limousine, Avant, Quattro, S6</li> 	<li>Tipuskód: 4B</li> 	<li>Típus variáció: Quattro</li> 	<li>Évjárat: 1997.02-tól</li> 	<li>Tengelyterhelés elöl (kg): 1100</li> 	<li>Tengelyterhelés hátul (kg): 1300</li> 	<li>Egyéb kitételek: Kivéve automata szintszabályzóval ellátott vagy automata szintszabályzóval beépíthető modellek.<br /> 	Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.<br /> 	Csak összkerékmeghajtású modellekhez (4x4, 4Motion, Quattro stb.)!</li> </ul>  <ul> 	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +50 mm, hátul: +25 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF80-017</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div> ', 'AP made by KW Audi A6 (Typ: 4B) Sedan, Avant, csak Quattro, 1997.02-től, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4b-sedan-avant-csak-quattro-1997-02-tol-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(240, '', '<div> <p>Ez a moduláris AP-Fahrwerke futóműállító rendszer az alábbi Audi A6 típusokhoz illeszkedik: Limuzin, Avant, Elsőkerék-hajtás</p>  <ul> 	<li>Modellkód: 4B</li> 	<li>Változat:</li> 	<li>Gyártási év: 1997.01-től</li> 	<li>Elülső tengelyterhelés (kg): 1100</li> 	<li>Hátsó tengelyterhelés (kg): 1185</li> 	<li>Kiemelt jellemzők: Kivéve a négykerék-hajtású modelleket!</li> </ul>  <ul> 	<li>Ez a futóműrendszer rendelkezik német nyelvű TÜV engedéllyel!</li> 	<li>Az engedély által előírt ültetési tartomány: elöl 30-65 mm, hátul 30-65 mm között állítható<br /> 	(Minden esetben a fenti tartományon belül állítható, azonban a TÜV engedély csak ezen beállításokra vonatkozik.)</li> 	<li>Extra ültetési lehetőség: elöl +50 mm, hátul +0 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Termékkód: GF10-009</strong></p> </div> ', 'AP made by KW Audi A6 (Typ: 4B) Sedan, Avant, kivéve Quattro, 1997.02-től, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4b-sedan-avant-kiveve-quattro-1997-02-tol-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(241, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A6</p>  <ul> 	<li><strong>Évjárat</strong>: 1997.02-2005</li> 	<li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li> 	<li><strong>Típus</strong>: Audi A6, Typ 4B (C5), Lim. / Sedan, Avant, 2WD</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1100 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1185 kg</li> </ul>  <p>Az autó kinézetét javító Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét a felhasználó igényeinek megfelelően szabályozhatja. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamizmus között. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Gyártva Németországban!</p> ', 'Vogtland Audi A6 (Typ: C5) Sedan és Avant, kivéve Quattro, 1997.02-2005-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-c5-sedan-es-avant-kiveve-quattro-1997-02-2005-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(242, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A6</p>\n<ul>\n    <li><strong>Évjárat</strong>: 1997.02-2005</li>\n    <li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li>\n    <li><strong>Típus</strong>: Audi A6, Typ 4B (C5), Lim. / Sedan, Avant, 2WD,</li>\n    <li><strong>Max. tengelyterhelés elõl</strong>: (több mint 1100 kg) 1250 kg</li>\n    <li><strong>Max. tengelyterhelés hátu</strong>l: 1185 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésén javítva és maximális vezetési élményt nyújtva a Vogtland állítható magasságú futómű szett lehetővé teszi az ültetés mértékének személyre szabott beállítását. A kiváló minőségű futómű csak speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éve van jelen a rugógyártás területén, 2 év garanciát biztosít az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel rendelkeznek.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968388</p>', 'Vogtland Audi A6 (Typ: C5) Sedan és Avant, kivéve Quattro, 1997.02-2005-ig, (első tengely terhelés 1100kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-c5-sedan-es-avant-kiveve-quattro-1997-02-2005-ig-els-tengely-terheles-1100kg-folott-allithato-magassagu-futomu'),
(243, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a Volkswagen Passat 1997-2005 közötti évjárathoz. Ez a minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú.</p>\n<p>Az ültetés mértéke 40-70 / 30-70 mm között állítható, és a készlet tartalmazza az összes szükséges alkatrészt a Volkswagen Passat Typ 3B, 3BG, 4WD, Limousine/Sedan, Variant típushoz. A maximális tengelyterhelés elől 1200 kg, míg hátul 1160 kg.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany! Cikkszám: 968370</p>', 'Vogtland Audi A6 (Typ: C5) Sedan és Avant Quattro, 1997.02-2004.12-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-c5-sedan-es-avant-quattro-1997-02-2004-12-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(244, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A6</p>  <ul> 	<li><strong>Évjárat</strong>: 1997.02-2005</li> 	<li><strong>Ültetés mértéke:</strong> 40 - 75 / 40 - 75 mm</li> 	<li><strong>Típus</strong>: Audi A6, Typ 4B (C5) Lim., Avant, Quattro, beleértve S6</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1350 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1300 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómû szett maximális vezetési élményt kínál. Az ültetés mértékét a felhasználó saját elképzelése szerint állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968059</p> ', 'Vogtland Audi A6 (Typ: C5) Sedan és Avant Quattro, beleértve S6, 1997.02-2004.12-ig, (első tengely terhelés 1101-1350kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-c5-sedan-es-avant-quattro-beleertve-s6-1997-02-2004-12-ig-els-tengely-terheles-1101-1350kg-allithato-magassagu-futomu'),
(245, '', '<p><strong>B14 állítható magasságú futómű</strong><br /><br /> Az egyedi BILSTEIN egycsöves rendszer Upside-Down technológiával van ellátva. A versenysportrugók szilárd anyagból készülnek, és állítható magasságot biztosítanak. A B14-gyel a BILSTEIN mérnökei innovatív versenysport technológiát hoztak az utcára. A B14 PSS lehetővé teszi, hogy a jármű magassága akár 50 mm-rel csökkenthető legyen az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű B14 PSS egycsöves Upside-Down technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmények között.</p>', 'Bilstein Audi A6 (Typ: C5), kivéve Quattro, 1997.12-2005.01-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-c5-kiveve-quattro-1997-12-2005-01-ig-bilstein-b14-allithato-magassagu-futomu'),
(246, '', '<div><strong>Bilstein B14 állítható magasságú futómű</strong><br />\\r\\n<br />\\r\\nAz egyedi BILSTEIN egycsöves rendszerének köszönhetően az Upside-Down technológiával készült futómű versenysportrugókkal rendelkezik, melyek nagy szilárdságú anyagból készültek. Az állítható magasság lehetőséget biztosít a rugótányér és a kontra anya alumíniumból történő gyors és könnyű beállítására. A BILSTEIN mérnökei a versenysport technológiát hozták az utcára a B14-gyel, ami komoly előnyt jelent a felhasználók számára. A B14 PSS-nél a jármű magassága az első és hátsó tengelynél akár 50 mm-rel is csökkenthető egy behatárolt, 20mm-es állítási tartományon belül. Az extrém terhelhetőséget és kiegyensúlyozott menetteljesítményt biztosító egycsöves Upside-Down technológia gondoskodik a vezetés öröméről bármely helyzetben.</div>\\r\\n', 'Bilstein Audi A6 (Typ: C5) Quattro, beleértve RS6, 1997.12-2005.01-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-c5-quattro-beleertve-rs6-1997-12-2005-01-ig-bilstein-b14-allithato-magassagu-futomu'),
(247, '', '<div><strong>Audi A6 (4B C5) Quattro Bilstein B16 PSS9 sport futómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső ültetés mértéke: 25 - 45 mm</div>\\r\\n\\r\\n<div>Hátsó ültetés mértéke: 20 - 40 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső tengely terhelése: 1260 kg</div>\\r\\n\\r\\n<div>Hátsó tengely terhelése: 1200 kg</div>', 'Bilstein Audi A6 (Typ: C5) Quattro, beleértve RS6, 1997.12-2005.01-ig, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-c5-quattro-beleertve-rs6-1997-12-2005-01-ig-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(248, '', '<div>Állítható magasságú és keménységű sport futómű Audi A6-hoz (4B C5) Bilstein B16 PSS9 típusú.</div>\\r\\n\\r\\n<div><strong>9 különböző keménységi fokozatban állítható!</strong></div>\\r\\n\\r\\n<div>Elülső ültetés mértéke: 35 - 55 mm</div>\\r\\n\\r\\n<div>Hátsó ültetés mértéke: 35 - 55 mm</div>\\r\\n\\r\\n<div>Első tengely terhelése: 1203 kg</div>\\r\\n\\r\\n<div>Hátsó tengely terhelése: 1130 kg</div>', 'Bilstein Audi A6 (Typ: C5), kivéve Quattro, 1997.12-2005.01-ig, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-c5-kiveve-quattro-1997-12-2005-01-ig-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(249, '', '<strong>Audi A6 Avant JOM BLUE LINE állítható magasságú sport futómű</strong><br />\\r\\nTípuskód: 4F, 4F1<br />\\r\\nGyártási évek: 2004 - 2011<br />\\r\\nKompatibilis Quattro és S6 modellekkel<br />\\r\\nA futómű hátsó tengelyénél a magasságállító a rugó alatt található.<br />\\r\\nElülső tengely terhelése: 1275 kg<br />\\r\\nHátsó tengely terhelése: 1240 kg<br />\\r\\nKészült Németországban<br />\\r\\nA futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagban megtalál.<br />\\r\\n1 ÉV TELJESKÖRŰ GARANCIÁVAL!!!<br />\\r\\nKiemelkedő minőség, rendkívül kedvező áron!!!<br />\\r\\nA szett tartalmaz: 4 darab lengéscsillapítót a hozzájuk tartozó rugókkal és az állításhoz szükséges 1 darab kulccsal</p>\\r\\n', 'Jom Bochum Audi A6 (Typ: 4F) Avant, beleértve Quattro, 2004-2011-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a6-typ-4f-avant-beleertve-quattro-2004-2011-ig-blue-line-allithato-magassagu-futomu'),
(250, '', '<strong>Audi A6 Sedan JOM BLUE LINE állítható magasságú sport futómű</strong><br />\\r\\nA 4F, 4F1 típuskóddal ellátott Audi A6 Sedanhoz tervezett JOM BLUE LINE futómű egy kiváló minőségű, Németországban gyártott termék. Ez a futómű ideális választás az 2004-2011 közötti modellekhez, beleértve a Quattro és S6 változatokat is. Ezt a futóművet a hátsó tengelyen található magasságállító jellemzi, mely a rugó alatt kapott helyet. Az elöl 1275 kg, míg hátul 1120 kg tengelyterhelésre tervezték. A csomag tartalmazza a német nyelvű TÜV engedélyt, valamint 2 év teljeskörű garanciát biztosít a vásárlóknak. A szett részét képezik 4 lengéscsillapító, hozzájuk tartozó rugókkal, valamint az állításhoz szükséges 1 kulccsal.</p>\\r\\n', 'Jom Bochum Audi A6 (Typ: 4F) Sedan, beleértve Quattro, 2004-2011-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a6-typ-4f-sedan-beleertve-quattro-2004-2011-ig-blue-line-allithato-magassagu-futomu'),
(251, '', '<p>Állítható magasságú FK-Automotive AK Street futómű</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Járműtípus: Audi (A6 Typ C6/4F) Avant</li>\\r\\n	<li>Gyártási év: 2005 - 2011</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Az ültetés mértéke körülbelül: 30 - 75 mm között szabályozható</li>\\r\\n	<li>Elől és hátul is változtatható a magassága</li>\\r\\n	<li>FK-Automotive AK Street futómű, mely nagy tartományban állítható</li>\\r\\n	<li>Sportos, szilárd és tartós kivitelű</li>\\r\\n	<li>Német TÜV engedéllyel rendelkezik</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A6 (Typ: 4F) Avant, beleértve Quattro, 2004-2011-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a6-typ-4f-avant-beleertve-quattro-2004-2011-ig-allithato-magassagu-futomu'),
(252, '', '<p>Állítható magasságú futómű az FK-Automotive AK Street modellje</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: Audi A6 Typ: 4F Sedan</li>\\r\\n	<li>Gyártási időszak: 2004 - 2011</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű ültetésének tartománya kb. 30 - 75 mm között állítható</li>\\r\\n	<li>Elöl és hátul is változtatható a magassága</li>\\r\\n	<li>Az FK-Automotive AK Street változtatható magasságú futómű</li>\\r\\n	<li>Széles skálán állítható a magassága</li>\\r\\n	<li>Sportos, merev és strapabíró kialakítású</li>\\r\\n	<li>Ellátva német nyelvű TÜV engedéllyel</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Audi A6 (Typ: 4F) Sedan, beleértve Quattro, 2004-2011-ig állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a6-typ-4f-sedan-beleertve-quattro-2004-2011-ig-allithato-magassagu-futomu'),
(253, '', '<p><strong>Audi A6 (Typ: 4F) Sedan és Avant MTS-Technik állítható magasságú sport futómû</strong></p>  \n<ul>  \n	<li><strong>Elsõ tengely terhelés: </strong>1241-1305kg</li>  \n	<li><strong>Hátsó tengely terhelés: </strong>1335kg</li>  \n	<li>Beleértve Quattro</li> \n</ul>  \n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár! A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> cég gyártja</li>  \n	<li>a magasság általában 25 és 80 mm között állítható</li>  \n	<li>gáztöltéses lengéscsillapítók</li>  \n	<li>kiemelkedő hatékonyság extrém igénybevétel mellett is</li>  \n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>  \n	<li>kiváló összhang a rugók és a lengéscsillapítók között</li>  \n	<li>a készlet plug & play, nem igényel autófelfüggesztés módosítást</li> \n</ul>  \n<p><u><strong>TÜV engedély:</strong></u> <a href=\"https://mtstechnik.com/data/links/6b32156defe999ce95aa93adf4321d2e/30327_6984.pdf\">Link a dokumentumhoz</a></p>  \n<p><u><strong>Szerelési útmutató:</strong></u> <a href=\"https://mtstechnik.com/data/links/27e68af179927f28c8ff7b1e16550f72/30327_6983.pdf\">Link a dokumentumhoz</a></p>  ', 'MTS-Technik by Nord Performance Audi A6 (Typ: 4F), beleértve Quattro, 2005.03-2011.08-ig, (első tengely terhelés 1241-1305kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-4f-beleertve-quattro-2005-03-2011-08-ig-els-tengely-terheles-1241-1305kg-allithato-magassagu-futomu'),
(254, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A rugók Eibach gyártmányúak, melyeknek a magassága rugalmasan beállítható általában 25 és 80 mm között. A gáztöltésű lengéscsillapítók magas hatékonyságot biztosítanak extrém körülmények között is. A futóművek két rétegű bevonattal rendelkeznek a hosszú távú korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek. A rugók és a lengéscsillapítók között optimális az összhang, így tökéletes vezetési élményt nyújtanak. A futóművek könnyen telepíthetők (plug & play), nem szükséges módosítás az autó felfüggesztésén. </p>  <p><u><strong>TÜV engedély:</strong></u> https://mtstechnik.com/data/links/6b32156defe999ce95aa93adf4321d2e/30327_6984.pdf</p>  <p><u><strong>Szerelési útmutató:</strong></u> https://mtstechnik.com/data/links/27e68af179927f28c8ff7b1e16550f72/30327_6983.pdf</p>', 'MTS-Technik by Nord Performance Audi A6 (Typ: 4F), beleértve Quattro, 2005.03-2011.08-ig, (első tengely terhelés 1240kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-4f-beleertve-quattro-2005-03-2011-08-ig-els-tengely-terheles-1240kg-alatt-allithato-magassagu-futomu'),
(255, '', '<ul>     <li><strong>Jellemzők</strong>: Audi A6, típus 4F, Sedan, 2WD, Quattro, kivéve azokat a modelleket, amelyek szintező rendszerrel vannak felszerelve</li>     <li><strong>Elülső tengely maximális terhelése</strong>: 1305 kg</li>     <li><strong>Hátsó tengely maximális terhelése</strong>: 1205 kg</li> </ul> <p>Az autó megjelenésének javítása mellett a termék optimális vezetési élményt nyújt. Az ültetés mértékét az egyéni igényeknek megfelelően lehet beállítani. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus vezetést biztosítanak. Az első osztályú korrózióvédelem garantált a lengéscsillapítók esetében.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint száz éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p> <p>A szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autó típusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p> <p>Németországban gyártva!</p> <p>Cikkszám: 968061</p>', 'Vogtland Audi A6 (Typ: 4F) Sedan, beleértve Quattro, 2004.05-től, (első tengely terhelés 1241-1305kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4f-sedan-beleertve-quattro-2004-05-tol-els-tengely-terheles-1241-1305kg-alatt-allithato-magassagu-futomu'),
(256, '', '<ul>\n    <li><strong>Autó típusa</strong>: Audi A6, Typ 4F, Lim. / Sedan, 2WD, Quattro, kivéve szintezõs modellek</li>\n    <li><strong>Elülső tengely maximális terhelése</strong>: 1240 kg</li>\n    <li><strong>Hátsó tengely maximális terhelése</strong>: 1205 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett ez a termék maximális vezetési élményt kínál. Az ültetés mértékét az egyedi elképzelések szerint állíthatja be. A futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott kényelmet és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968060</p>', 'Vogtland Audi A6 (Typ: 4F) Sedan, beleértve Quattro, 2004.05-től, (első tengely terhelés 1240kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4f-sedan-beleertve-quattro-2004-05-tol-els-tengely-terheles-1240kg-alatt-allithato-magassagu-futomu'),
(257, '', '<ul>     <li><strong>Modell</strong>: Audi A6, Typ 4F, Avant, 2WD, Quattro, kivéve szintezõs típusok</li>     <li><strong>Elülső tengely maximális terhelése</strong>: 1305 kg</li>     <li><strong>Hátsó tengely maximális terhelése</strong>: 1300 kg</li>     <li> </li> </ul> <p>Az autó megjelenésének javítása mellett a termék optimális vezetési élményt nyújt. Az ültetés mértékét a felhasználó igényeinek megfelelően szabályozhatja. Ennek a kiváló minőségű futómű szettnak részei a speciális, nagy teljesítményű kétcsöves lengéscsillapítók, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamizmus között. Az első osztályú korrózióvédelem biztosítja a lengéscsillapítók hosszú élettartamát.</p> <p>A termék TÜV minősítéssel rendelkezik. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugók területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra!</p> <p>A szett alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve a szintező- vagy torziós futóművel szerelt autók esetében.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968063</p>', 'Vogtland Audi A6 (Typ: 4F) Avant, beleértve Quattro, 2005.02-től, (első tengely terhelés 1241-1305kg-ig) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4f-avant-beleertve-quattro-2005-02-tol-els-tengely-terheles-1241-1305kg-ig-allithato-magassagu-futomu'),
(258, '', '<ul>     <li><strong>Autó típusa</strong>: Audi A6, Typ 4F, Avant, 2WD, Quattro, kivéve szintezõs modellek</li>     <li><strong>Maximális tengelyterhelés elõl</strong>: 1240 kg</li>     <li><strong>Maximális tengelyterhelés hátul</strong>: 1300 kg</li> </ul> <p>Az autó megjelenését fokozva, valamint kiváló vezetési élményt nyújtva ez a futómű szett lehetőséget biztosít az ültetés mértékének személyre szabására. A minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerük révén kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>Az termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezővel vagy torziós felfüggesztéssel rendelkeznek.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968062</p>', 'Vogtland Audi A6 (Typ: 4F) Avant, beleértve Quattro, 2005.02-től, (első tengely terhelés 1240kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4f-avant-beleertve-quattro-2005-02-tol-els-tengely-terheles-1240kg-alatt-allithato-magassagu-futomu'),
(259, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kombináljuk a maximális ültetéssel.</div> <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A6 (Typ: 4F) Sedan, beleértve Quattro, 2004.05-től, (első tengely terhelés 1240kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4f-sedan-beleertve-quattro-2004-05-tol-els-tengely-terheles-1240kg-alatt-allithato-magassagu-futomu'),
(260, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák az általuk kívánt ültetést. A maximális ültetés mellett sportos irányíthatóságot és optimális vezetési magatartást biztosítunk.</div> <div>Egy alumínium rugótányér segítségével egyénileg beállítható a járműmagasság a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes egyensúlyát nyújtjuk egy optimális felépítéssel.</div> <ul> <li>megfizethető áron elérhető kiváló minőség</li> <li>TÜV által engedélyezett tartományban egyéni magasságbeállítás</li> <li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár-érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A6 (Typ: 4F) Avant, beleértve Quattro, 2005.02-től, (első tengely terhelés 1241-1305kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4f-avant-beleertve-quattro-2005-02-tol-els-tengely-terheles-1241-1305kg-ig-allithato-magassagu-futomu'),
(261, '', '<div>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, akik pontosan beállíthatják az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kombináljuk a maximális ültetéssel.</div>  \n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV engedélyezte tartományon belül. A sportosság, kényelem és biztonság tökéletes egyensúlyát biztosítjuk ezzel az optimális felépítéssel.</div>  \n<ul>  \n	<li>kiváló minőség, megfizethető áron</li>  \n	<li>egyéni magasság beállítás a TÜV által engedélyezett határokon belül</li>  \n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>  \n	<li>egyedülálló ár-érték arány</li>  \n	<li>német minőség</li> \n</ul>', 'AP made by KW Audi A6 (Typ: 4F) Avant, beleértve Quattro, 2005.02-től, (első tengely terhelés 1240kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4f-avant-beleertve-quattro-2005-02-tol-els-tengely-terheles-1240kg-alatt-allithato-magassagu-futomu'),
(262, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy a kívánt üléspozíciót precízen beállítsa. A sportos irányíthatóság és vezetési viselkedés optimális kombinációját nyújtjuk, maximalizálva ezzel az ülésmagasságot.</div> <div>A járműmagasság egyedi beállítására alumínium rugótányér segítségével van mód a TÜV által engedélyezett tartományon belül. A sportosságot, kényelmet és biztonságot párhuzamosan összehangolva optimális felépítést biztosítunk.</div> <ul> <li>kiváló minőségű termék megfizethető áron</li> <li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li> <li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár-érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Audi A6 (Typ: 4F) Sedan, beleértve Quattro, 2004.05-től, (első tengely terhelés 1241-1305kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4f-sedan-beleertve-quattro-2004-05-tol-els-tengely-terheles-1241-1305kg-alatt-allithato-magassagu-futomu'),
(263, '', '<div>\n<div><span><strong>Audi A6 (4F) Bilstein B14 állítható magasságú sport futómű</strong></span></div>\n\n<div> </div>\n\n<div><span>Ültetés mértéke elöl: 20 - 40 mm</span></div>\n\n<div><span>Ültetés mértéke hátul: 20 - 40 mm</span></div>\n\n<div> </div>\n\n<div><span>Első tengely terhelése: 1410 kg</span></div>\n\n<div><span>Hátsó tengely terhelése: 1380 kg</span></div>\n\n<div> </div>\n\n<div><span>BILSTEIN egycsöves rendszer<br />\nUpside-Down technológiával<br />\nVersenysportrugók nagy szilárdságú anyagból<br />\nÁllítható magasság (a rugótányér és a kontra anya alumíniumból készül)<br />\nVersenysport technológia az utcára, a B14-gyel a BILSTEIN mérnökei ezt az elképzelést valósították meg, ami óriási előnyt jelent. A B14 PSS-nél a jármű magassága, az első és hátsó tengelynél max. 50 mm-rel csökkenthető, egy behatárolt 20mm-es állítási tartományon belül. A B14 PSS extrémen terhelhető egy csöves Upside-Down technológiája gondoskodik minden szituációban a kiegyensúlyozott menetteljesítményről és a vezetés öröméről.</span></div>\n</div>', 'Bilstein Audi A6 (Typ: 4F C6), beleértve S6 és RS6, kivéve légrugós és DRC futóművel szerelt, 2004.05-2011.03-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-4f-c6-beleertve-s6-es-rs6-kiveve-legrugos-es-drc-futomuvel-szerelt-2004-05-2011-03-ig-bilstein-b14-allithato-magassagu-futomu'),
(264, '', '<div>\\r\\n<div><strong>Audi A6 (4B C5) Bilstein B16 PSS9 sport futómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Kiváló minőségű sport futómű, melynek magassága és keménysége állítható.</div>\\r\\n\\r\\n<div>Különlegessége, hogy 9 fokozatban szabályozható a keménysége.</div>\\r\\n\\r\\n<div>Elülső ültetés mértéke: 35 - 55 mm</div>\\r\\n\\r\\n<div>Hátsó ültetés mértéke: 35 - 55 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső tengely terhelése: 1203 kg</div>\\r\\n\\r\\n<div>Hátsó tengely terhelése: 1130 kg</div>\\r\\n</div>\\r\\n', 'Bilstein Audi A6 (Typ: 4F C6), beleértve S6 és RS6, kivéve légrugós, 2004.05-2011.03-ig, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-4f-c6-beleertve-s6-es-rs6-kiveve-legrugos-2004-05-2011-03-ig-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(265, '', '<strong>Átállítható magasságú futómű az Audi A6-hoz Bochumban</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Az Audi A6 Sedan modellekhez készült futómű</li>\\r\\n	<li>Elérhető változatok: 1.8TFSi, 2.0TDi, 2.0TFSi, 2.8FSi, 3.0TDi, 3.0TFSi</li>\\r\\n	<li>Kompatibilis Quattro változatokkal is</li>\\r\\n	<li>Gyártási éve: 2010.11-től</li>\\r\\n	<li>Elülső tengely maximális terhelése: 1215kg</li>\\r\\n	<li>Hátsó tengely maximális terhelése: 1240kg</li>\\r\\n	<li>Rendelkezik TÜV engedéllyel</li>\\r\\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-50mm, hátul: 20-50mm között szabályozható<br />\\r\\n	(Számos esetben nagyobb intervallumban is állítható a futómű magassága, azonban a TÜV engedély csak a fent említett beállításokat engedélyezi)</li>\\r\\n	<li>Németországban gyártott termék</li>\\r\\n	<li>\\r\\n	<p><strong>Cikkszám: </strong>741219</p>\\r\\n	</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Audi A6 (Typ: 4G) Sedan, beleértve Quattro, 2010.11-től állítható magasságú futómű', '', '', '', 'jom-bochum-audi-a6-typ-4g-sedan-beleertve-quattro-2010-11-tol-allithato-magassagu-futomu'),
(266, '', '<p>Állítható magasságú futómű az FK-Automotive AK Street termékcsaládból.</p>\n\n<ul>\n	<li>Autótípus: Audi A6 Typ: 4G C7</li>\n	<li>Kivéve Quattro</li>\n	<li>Évjárat: 2010.11-től</li>\n</ul>\n\n<ul>\n	<li>Az ültetés mértéke körülbelül 30 - 75 mm között változtatható</li>\n	<li>Elülső és hátsó részen is állítható a magasság</li>\n	<li>Felhasználóbarát FK-Automotive AK Street futómű</li>\n	<li>Széles skálán állítható magasság</li>\n	<li>Sportos, dinamikus és masszív kialakítás</li>\n	<li>Német nyelvű TÜV engedéllyel rendelkezik</li>\n	<li>Anyaga: Acél</li>\n</ul>', 'FK-Automotive Audi A6 (Typ: 4G), kivéve Quattro, 2010.11-től állítható magasságú futómű', '', '', '', 'fk-automotive-audi-a6-typ-4g-kiveve-quattro-2010-11-tol-allithato-magassagu-futomu'),
(267, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <ul> 	<li>Első tengely teherbírása: legfeljebb 1080 kg</li> 	<li>Hátsó tengely teherbírása: legfeljebb 1365 kg</li> 	<li>Elülső ültetés mértéke: 15-70 mm között</li> 	<li>Hátsó ültetés mértéke: 15-70 mm között</li> 	<li><strong>Ez a futómű rendelkezik TÜV engedéllyel!</strong></li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akiknek fontos a kiváló minőség és az megfizethető ár! A fokozatmentesen állítható magasságnak köszönhetően könnyedén lehet testre szabni az autó hasmagasságát az útviszonyoknak megfelelően! Az MTS-Technik állítható futóművei kiemelkedő egyensúlyt biztosítanak a rugók és a lengéscsillapítók között. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság szabadon változtatható általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiemelkedő hatékonyság extrém körülmények között is</li> 	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>tökéletes harmónia a rugók és a lengéscsillapítók között</li> 	<li>a készlet könnyen beszerelhető, nem igényel módosítást az autó felfüggesztésén</li> </ul> ', 'MTS-Technik by Nord Performance Audi A6 (Typ: 4G C7), beleértve Quattro, 2010.11-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-4g-c7-beleertve-quattro-2010-11-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(268, '', '<p>Az állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futóművek fokozatmentesen állítható magassága lehetővé teszi az autó alvázának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik állítható futóművei a rugók és a lengéscsillapítók optimális egyensúlyára épülnek.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Audi A6 (Typ: 4G C7), beleértve Quattro, 2010.11-től, (első tengely terhelés 1081-1245kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a6-typ-4g-c7-beleertve-quattro-2010-11-tol-els-tengely-terheles-1081-1245kg-allithato-magassagu-futomu'),
(269, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás az Audi A6 Avant típusú autókhoz. Ez a minőségi futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. Az ültetés mértéke egyéni igények szerint állítható 35-65 mm tartományban. A termék maximális vezetési élményt nyújt, miközben javítja az autó megjelenését.</p>\n\n<p>Ez a futómű szett kompatibilis az Audi A6 Typ 4G Avant modellekkel, beleértve a Quattro változatokat is. A maximális tengelyterhelés elől 1171-1320 kg, míg hátlapján 1425 kg. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, így hosszú távon is megfelelő teljesítményt biztosítanak.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugóból és 4 db lengéscsillapítóból áll, kivéve azoknál az autótípusoknál, amelyekhez szintezős vagy torziós futómű tartozik.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Audi A6 (Typ: 4G) Avant, beleértve Quattro, 2011.03-tól, (első tengely terhelés 1171-1320kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4g-avant-beleertve-quattro-2011-03-tol-els-tengely-terheles-1171-1320kg-allithato-magassagu-futomu'),
(270, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás az AUDI A6 Avant modellekhez. Ez a minőségi futómű kiválóan javítja az autó megjelenését és biztosítja a maximális vezetési élményt. Az ültetés mértéke könnyedén beállítható a megfelelő értékekre, így személyre szabhatod az autód alacsonyabban történő ültetését. A speciális, nagy teljesítményű két csöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugók területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Audi A6 (Typ: 4G) Avant, beleértve Quattro, 2011.03-tól, (első tengely terhelés 1170kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4g-avant-beleertve-quattro-2011-03-tol-els-tengely-terheles-1170kg-alatt-allithato-magassagu-futomu'),
(271, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás lehet az Audi A6 Sedan típusú autókhoz, beleértve a Quattro modelleket is. Ez a futómű kitűnő lehetőséget biztosít arra, hogy az autó megjelenése javuljon, miközben maximális vezetési élményt nyújt. A futómű beállítása rugalmas, hiszen lehetőség van az ültetés mértékének változtatására az egyéni igények szerint. A szett magas minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél más típusú futóműrendszer van beépítve.</p>\n<p>Made in Germany!</p>', 'Vogtland Audi A6 (Typ: 4G) Sedan, beleértve Quattro, 2011.03-tól, (első tengely terhelés 1170kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4g-sedan-beleertve-quattro-2011-03-tol-els-tengely-terheles-1170kg-alatt-allithato-magassagu-futomu'),
(272, '', '<p>Vogtland által készített állítható magasságú futómű szett, mely kompatibilis az Audi A6 Sedan modellel, beleértve a Quattro változatot is, az 2011.03-tól gyártott modellekhez. Az ültetés mértéke 35 - 65 mm között állítható, lehetőséget adva a személyre szabásra. A futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók biztosítják a hosszú távú megbízhatóságot.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó több mint száz éves tapasztalattal rendelkezik a rugógyártás területén. A szett 2 év garanciát biztosít az ültetőrugókra és a lengéscsillapítókra. Alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak ellátva.</p>\n<p>Made in Germany!</p>', 'Vogtland Audi A6 (Typ: 4G) Sedan, beleértve Quattro, 2011.03-tól, (első tengely terhelés 1171-1305kg) állítható magasságú futómű', '', '', '', 'vogtland-audi-a6-typ-4g-sedan-beleertve-quattro-2011-03-tol-els-tengely-terheles-1171-1305kg-allithato-magassagu-futomu'),
(273, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák a kívánt ültetést. Az optimális vezetési magatartást és a sportos irányíthatóságot kombinálva maximalizáljuk az ültetést.</span></div> <div><span>Egy alumínium rugótányér segítségével egyénileg beállítható a járműmagasság a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság optimális egyensúlyát biztosítjuk.</span></div> <ul>     <li><span>Minőségi termék megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás TÜV engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedi ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Audi A6 (Typ: 4G) Avant, 2011.09-tól, (első tengely terhelés 1170kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4g-avant-2011-09-tol-els-tengely-terheles-1170kg-folott-allithato-magassagu-futomu'),
(274, '', '<div><span>Az Ap futómű tökéletes választás a sportosan ambiciózus vezetők számára, akik szeretnék a jármű ültetését precízen beállítani. A sportos irányíthatóság és optimális vezetési élmény ötvözve a maximális ültetéssel.</span></div> <div><span>Egy alumínium rugótányér segítségével könnyedén állítható a jármű magassága a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság tökéletes összhangját biztosító optimális megoldás.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Különleges ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Audi A6 (Typ: 4G) Avant, 2011.09-tól, (első tengely terhelés 1170kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4g-avant-2011-09-tol-els-tengely-terheles-1170kg-alatt-allithato-magassagu-futomu'),
(275, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy precízen beállíthassa az általa kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk, maximalizálva ezzel az ültetést.</span></div> <div><span>A járműmagasságot egy alumínium rugótányér segítségével egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtjük meg egy optimális felépítés keretein belül.</span></div> <ul>     <li><span>kiváló minőségű termék megfizethető áron</span></li>     <li><span>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kimagasló ár-érték arány</span></li>     <li><span>német minőségű</span></li> </ul>', 'AP made by KW Audi A6 (Typ: 4G) Sedan, 2011.03-tól, (első tengely terhelés 1170kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4g-sedan-2011-03-tol-els-tengely-terheles-1170kg-folott-allithato-magassagu-futomu'),
(276, '', '<div><span>Az Ap futómű olyan lehetőséget kínál a sportosan ambiciózus vezetőknek, hogy milliméter pontosan beállíthassák az általuk kívánt ültetést. Ennek során a sportos irányíthatóságot és az optimális vezetési magatartást egyesítjük a maximális ültetéssel.</span></div> <div><span>A járműmagasság egyénileg beállítható az alumínium rugótányér segítségével a TÜV által engedélyezett tartományban. Ennek eredményeként a sportosság, a kényelem és a biztonság tökéletes harmóniában van egymással, biztosítva az optimális felépítést.</span></div> <ul>     <li><span>kiváló minőség elérhető áron</span></li>     <li><span>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kivételes ár-érték arány</span></li>     <li><span>német minőségű termék</span></li> </ul>', 'AP made by KW Audi A6 (Typ: 4G) Sedan, 2011.03-tól, (első tengely terhelés 1170kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a6-typ-4g-sedan-2011-03-tol-els-tengely-terheles-1170kg-alatt-allithato-magassagu-futomu'),
(277, '', '<div><strong>Audi A6 (Typ 4G C7) Bilstein B16 állítható futómű</strong></div>  <div> </div>  <div>Az autó ülésmagassága elöl 30 - 50 mm között állítható, míg hátul ugyanez az érték 30 - 50 mm (S6-nál 15 - 35 mm).</div>  <div> </div>  <div>Ez a futómű nem alkalmas légrugóval szerelt típusokhoz.</div> ', 'Bilstein Audi A6 (Typ: 4G), beleértve Quattro és S6, 2010.11-től, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-audi-a6-typ-4g-beleertve-quattro-es-s6-2010-11-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(278, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az versenyképes árakat. A futóművek magassága fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon változtatható, általában 25 és 80 mm között.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Kiemelkedő hatékonyság extrém igénybevételek során is.</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek).</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet könnyen beépíthető, nem igényel módosítást az autó felfüggesztésén.</li>\n</ul>', 'MTS-Technik by Nord Performance Audi A7 Sportback, beleértve Quattro, 2010.10-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a7-sportback-beleertve-quattro-2010-10-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(279, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választást jelentenek azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az versenyképes árakat! A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén igazítsa az autó hasmagasságát az aktuális útviszonyokhoz. Az MTS-Technik futóműveinek rugós és lengéscsillapítói között optimális egyensúly van. </p><p><u>Termékjellemzők:</u></p><ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasságot általában 25 és 80 mm között lehet szabadon állítani</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelésnél is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Audi A7 Sportback, beleértve Quattro, 2010.10-től, (első tengely terhelés 1081-1245kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a7-sportback-beleertve-quattro-2010-10-tol-els-tengely-terheles-1081-1245kg-allithato-magassagu-futomu'),
(280, '', '<div> <p>Az AP-Fahrwerke Állítható magasságú futómû kompatibilis az alábbi Audi A7 Quattro, Sportback, Elsõ kerék hajtás típusokkal, melyekhez a következő paraméterek tartoznak:</p>  <ul> 	<li>Tipuskód: 4G, 4G1</li> 	<li>Évjárat: 2010.10-tõl</li> 	<li>Tengelyterhelés elöl (kg): 1215</li> 	<li>Tengelyterhelés hátul (kg): 1255</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!<br /> 	Kivéve automata szintszabályzóval ellátott vagy automata szintszabályzóval beépithetõ modellek.<br /> 	Elektromágneses futómûvel (DCC) rendelkezõ járműveknél az elektronikus vezérlõegység deaktiválása szükséges!</li> </ul>  <ul> 	<li>Ez a futómûszett rendelkezik Német nyelvű TÜV engedéllyel, mely meghatározza az ültetés mértékét elöl: 35-60 mm, hátul: 30-55 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +85 mm, hátul: +5 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF10-078</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Audi A7 (Typ: 4G, 4G1), kivéve légrugós futóművel szerelt, 2010.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-a7-typ-4g-4g1-kiveve-legrugos-futomuvel-szerelt-2010-10-tol-allithato-magassagu-futomu'),
(281, '', '<div><strong><span>Audi A7 (Typ: 4G, 4G1) equipped with Vogtland adjustable height sports suspension</span></strong><span><br /></span></div> <div> </div> <ul>     <li><strong>Front lowering range:</strong> 35 - 60 mm</li>     <li><strong>Rear lowering range:</strong> 35 - 60 mm</li>     <li><strong>Max. front axle load capacity:</strong> (up to) 1215 kg</li>     <li><strong>Max. rear axle load capacity:</strong> 1255 kg</li> </ul> <p>Enhancing the car\'s appearance while providing an exceptional driving experience, this high-quality suspension kit allows you to adjust the lowering range according to your preferences. The kit includes specially designed, high-performance twin-tube shock absorbers that ensure balanced comfort and increased dynamics thanks to the low-pressure gas system. The shock absorbers feature top-notch corrosion protection.</p> <p>This product is TÜV approved. The manufacturer, with over 100 years of experience in spring production, provides a 2-year warranty for the lowering springs and shock absorbers!</p> <p>The standard kit includes 4 lowering springs and 4 shock absorbers, except for car models equipped with leveling or torsion suspensions.</p> <p>Made in Germany!</p> <p>Item number: 968189</p>', 'Vogtland Audi A7 (Typ: 4G, 4G1), kivéve légrugós futóművel szerelt, 2010.10-től állítható magasságú futómű', '', '', '', 'vogtland-audi-a7-typ-4g-4g1-kiveve-legrugos-futomuvel-szerelt-2010-10-tol-allithato-magassagu-futomu'),
(282, '', '<div><strong>Audi A6 (Typ 4G C7) Bilstein B16 futómű állítható magassággal és keménységgel</strong></div>\n<div> </div>\n<div>Az ültetés mértéke az elülső részen: 30 - 50 mm (a S6-nál 15 - 35 mm)</div>\n<div>Az ültetés mértéke a hátsó részen: 30 - 50 mm (a S6-nál 15 - 35 mm)</div>\n<div> </div>\n<div>Kivéve azokat a modelleket, amelyek légrugóval vannak felszerelve!</div>', 'Bilstein Audi A7 (Typ: 4G, 4G1), kivéve légrugós futóművel szerelt, 2010.10-től, Bilstein B16,állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-audi-a7-typ-4g-4g1-kiveve-legrugos-futomuvel-szerelt-2010-10-tol-bilstein-b16allithato-kemenysegu-allithato-magassagu-futomu'),
(283, '', '<p><strong>Audi A8 MTS-Technik Street Series</strong> sport futómű</p>\n<ul>\n	<li><strong>Audi A8 D2</strong>, különböző motorváltozatok</li>\n	<li><strong>Audi A8 D2</strong>, Quattro változatok és S8 Quattro</li>\n	<li>Állítható ülésmagasság elöl: 10-60mm</li>\n	<li>Állítható ülésmagasság hátul: 10-30mm</li>\n	<li>Első tengely terhelés: 1380kg</li>\n	<li>Hátsó tengely terhelés: 1230kg</li>\n	<li>Rugó erő (első, fő): 150 N/mm</li>\n	<li>Rugó erő (első, segéd): 20 N/mm</li>\n	<li>Rugó erő (hátsó, fő): 82,2 N/mm</li>\n	<li>TÜV engedéllyel</li>\n</ul>\n<p>A MTS-Technik Street Series sport futóművei ideális választás azok számára, akik kiemelkedő minőséget és versenyképes árat keresnek! A fokozatmentesen állítható magasság lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben az optimális egyensúlyt a rugók és a lengéscsillapítók között garantálják.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangban</li>\n	<li>Plug & Play készlet, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A8 (Typ: D2), beleértve Quattro, kivéve légrugós, 1994.03-2002.12-ig, (első tengely terhelés 1380kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a8-typ-d2-beleertve-quattro-kiveve-legrugos-1994-03-2002-12-ig-els-tengely-terheles-1380kg-alatt-street-series-allithato-magassagu-futomu'),
(284, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik Sport állítható futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében.</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a fő cél.</li>\n	<li>Gáztöltetű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi A8 (Typ: D2), beleértve Quattro, kivéve légrugós, 1994.03-2002.12-ig, (első tengely terhelés 1380kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-a8-typ-d2-beleertve-quattro-kiveve-legrugos-1994-03-2002-12-ig-els-tengely-terheles-1380kg-alatt-sport-series-allithato-magassagu-futomu'),
(285, '', '<p><strong>Volkswagen Passat B8 Variant MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>Az alábbi típusokhoz tervezve:</p>\\r\\n\\r\\n<ul>\\r\\n\\t<li><strong>Volkswagen Passat B8 Variant</strong> különböző motorváltozatokkal és hajtáskombinációkkal</li>\\r\\n\\t<li>Első tengely terhelése: 1061-1200kg</li>\\r\\n\\t<li>Hátsó tengely terhelése: 1250kg alatt</li>\\r\\n\\t<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\\r\\n\\t<li>Elülső ültetési mélység: 35-65mm</li>\\r\\n\\t<li>Hátsó ültetési mélység: 25-75mm</li>\\r\\n\\t<li>Nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van</li>\\r\\n\\t<li>Fontos! Ajánlott rövidített stabilizátor rúd használata (nem tartalmazza a készlet)</li>\\r\\n</ul>\\r\\n\\r\\n<p>A MTS-Technik sport futóművei ideális választás azoknak, akik számára fontos a minőség és az ár aránya! A futóművek fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben harmonikus az egyensúly a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n\\t<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\\r\\n\\t<li>Gáztöltésű lengéscsillapítók</li>\\r\\n\\t<li>Magas hatékonyság extrém körülmények között is</li>\\r\\n\\t<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\\r\\n\\t<li>Rugó és lengéscsillapító tökéletes összhangja</li>\\r\\n\\t<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n\\r\\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Audi Q2 (Typ: GA) Quattro, 2016.06-tól, (első tengely terhelés 1061-1200kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-q2-typ-ga-quattro-2016-06-tol-els-tengely-terheles-1061-1200kg-street-series-allithato-magassagu-futomu'),
(286, '', '<strong>Audi Q3 Street Series MTS-Technik állítható magasságú sport futómű</strong></p>\n<ul>\n	<li>Az Audi Q3 (Typ: 8U) különböző motorváltozataihoz készült állítható magasságú sport futómű</li>\n	<li>A futómű ültetése elöl és hátul is 35-65mm között állítható</li>\n	<li>Az első tengely maximális terhelése: 1200kg, míg a hátsó tengelyé: 1170kg</li>\n	<li>A futómű jelenleg még nem rendelkezik TÜV engedéllyel, de az engedélyeztetés folyamatban van</li>\n</ul>\n<p>A MTS-Technik sport futóművei ideális választás azoknak, akik minőségi terméket kedvező áron keresnek. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóművei kiválóan egyensúlyozzák a rugók és lengéscsillapítók viszonyát.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach gyártja</li>\n	<li>A magasság széles skálán, legtöbbször 25 és 80mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért</li>\n	<li>A futómű plug & play kialakítása nem igényel módosítást a felfüggesztésben</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi Q3 (Typ: 8U), beleértve Quattro, 2011.06-2018.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-q3-typ-8u-beleertve-quattro-2011-06-2018-12-ig-street-series-allithato-magassagu-futomu'),
(287, '', '<p><strong>MTS-Technik állítható magasságú sport futómű</strong></p>  \n<ul>\n	<li>Audi Q3 (8U típus), 1.4TFSI / 1.4TSI / 2.0TFSI / 2.0TFSI Quattro / RS 2.5 Quattro / RS performance 2.5 Quattro / 2.0TDI / 2.0TDI Quattro</li>\n	<li>Elülső ültetés mértéke: 35-65mm</li>\n	<li>Hátsó ültetés mértéke: 35-65mm</li>\n	<li>Elülső tengely terhelés: 1200kg</li>\n	<li>Hátsó tengely terhelés: 1170kg</li>\n	<li>A termék jelenleg nem rendelkezik TÜV engedéllyel (engedélyezés folyamatban)</li>\n</ul>  \n<p>A <strong>MTS-Technik Sport futóművei</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> optimális összhangot biztosítanak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. A maximális vezetési élmény és a széles ültetési tartomány garantált.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a sportosság érdekében</li>\n	<li>A <strong>Sport futómű</strong> létrehozásakor a cél a széles ültetési tartomány és a fokozott vezetési élmény volt</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszú élettartam érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>  \n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi Q3 (Typ: 8U), beleértve Quattro, 2011.06-2018.12-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-q3-typ-8u-beleertve-quattro-2011-06-2018-12-ig-sport-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(288, '', '<p>Egy olyan állítható magasságú futómű szett, melyet kifejezetten az Audi Q3 típusú járművekhez terveztek. Az évjárattól függően, 35-65 mm-es ültetési mélységet érhet el vele az autó tulajdonosa. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel vannak ellátva a kiegyensúlyozott kényelem és dinamika érdekében. A lengéscsillapítók kiváló korroziónak ellenállnak, így hosszú távon is megfelelő teljesítményt nyújtanak.</p>\n\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n\n<p>Made in Germany!</p>', 'Vogtland  Audi Q3 (Typ: 8U), 2011.10-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland--audi-q3-typ-8u-2011-10-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(289, '', '<div><p>Az AP-Fahrwerke Állítható magasságú futómű az alábbi autótípushoz illeszkedik:</p> <ul> <li>Audi Q3 Első kerék hajtás, Quattro, Első Lengéscsillapító átmérője: 55mm</li> <li>Tipuskód: 8U</li> <li>Évjárat: 2011.10-től</li> <li>Tengelyterhelés elöl (kg): 1190</li> <li>Tengelyterhelés hátul (kg): 1170</li> <li>Egyéb információ: Kizárólag 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li> </ul> <ul> <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> <li>Az engedély által meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br /> (A futómű minden esetben nagyobb intervallumban állítható, azonban a TÜV engedély csak a fenti beállításokra érvényes.)</li> <li>Extra ültetési lehetőség elöl: +10 mm, hátul: +0 mm</li> </ul> <ul> <li>Gyártás helye: Ap-Fahrwerke Németország</li> <li>Garancia időtartama: 2 év</li> </ul> <p><strong>Cikkszám: GF80-077</strong></p> <p><br /> Az ár 1 szettre vonatkozik!</p> </div> <div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek, hogy a kívánt ültetést milliméterre beállíthassák. A sportos irányíthatóságot és optimális vezetési viselkedést a maximális ültetéssel kombinálva kínáljuk.</span></div> <div>Egy alumínium rugótányér segítségével lehetséges a jármű magasságának egyénileg történő beállítása a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság optimális összehangolása egy ideális felépítést eredményez.</div> <ul> <li>kiváló minőség elérhető áron</li> <li>egyedi magasságbeállítás a TÜV által engedélyezett határok között</li> <li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> <li>megfizethetetlen ár-érték arány</li> <li>Német minőség</li> </ul>', 'AP made by KW Audi Q3 (Typ: 8U), beleértve RSQ3, 2011.10-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-q3-typ-8u-beleertve-rsq3-2011-10-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(290, '', '<p>Egy olyan sport futómű, amelynek magassága fokozatmentesen állítható a Porsche Macan 2.0 / 3.0S / 3.0S Diesel modellekhez. Az első tengely terhelése 1290kg, míg a hátsóé 1360kg. Fontos tudni, hogy jelenleg nincs TÜV engedélye, de az engedélyezés folyamatban van.</p>\n\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik minőségi és megfizethető árat keresnek. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi Q5 (Typ: 8R), kivéve Magnetic Ride Control, 2008.11-2017.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-q5-typ-8r-kiveve-magnetic-ride-control-2008-11-2017-12-ig-street-series-allithato-magassagu-futomu'),
(291, '', '<div><strong>Audi R8 Bilstein B16 állítható magasságú sport futómű</strong></div> <div> </div> <div> <div>Az első ültetés mértéke 10 - 25 mm között, míg a hátsó ültetés mértéke 20 - 35 mm között állítható.</div> <div> </div> <div>Az első tengely terhelése 940 kg, míg a hátsó tengely terhelése 1095 kg.</div> <div> </div> <div>Az itt említett termék rendelkezik TÜV engedéllyel!</div> </div>', 'Bilstein Audi R8, 2007.04-től, Bilstein B16 állítható magasságú futómű', '', '', '', 'bilstein-audi-r8-2007-04-tol-bilstein-b16-allithato-magassagu-futomu'),
(292, '', '<p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat! Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága, mivel fokozatmentesen állítható magassággal rendelkeznek. Az MTS-Technik futóműveiben optimális egyensúly van a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja, melyek magassága általában 25 és 80 mm között szabadon állítható.</li>\n	<li>A lengéscsillapítók gáztöltésesek, és magas hatékonyságot biztosítanak extrém terhelés mellett is.</li>\n	<li>A hosszan tartó korrózióvédelem érdekében két rétegű bevonattal rendelkeznek (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással.</li>\n	<li>A készlet plug & play, így nem szükséges módosításokat végrehajtani az autó felfüggesztésén.</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi TT (Typ: 8J), beleértve Quattro, 2006.08-2014.06-ig, (első tengely terhelés 966-1060kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8j-beleertve-quattro-2006-08-2014-06-ig-els-tengely-terheles-966-1060kg-street-series-allithato-magassagu-futomu'),
(293, '', '<strong>Audi A3 MTS-Technik sport futómű állítható magassággal</strong></p>  <p>Ez a futómű megfelel az alábbi típusokhoz:</p>  <ul> 	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1035kg</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elöl: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár! Az állítható magasság lehetővé teszi a könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság fokozatmentesen állítható általában 25-80 mm között</li> 	<li>gáztöltetű lengéscsillapítók</li> 	<li>kiemelkedő hatékonyság extrém terhelésnél is</li> 	<li>kettős bevonat a hosszú élettartam érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>ideális rugó-lengéscsillapító összhang</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p> ', 'MTS-Technik by Nord Performance Audi TT (Typ: 8J), beleértve Quattro, 2006.08-2014.06-ig, (első tengely terhelés 965kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8j-beleertve-quattro-2006-08-2014-06-ig-els-tengely-terheles-965kg-alatt-street-series-allithato-magassagu-futomu'),
(294, '', '<em>Audi TT V-Maxx futómű állítható magasságú</em><br /><br /><ul><br /><li>Az Audi TT Coupé 1.8TFSi és 2.0TFSi változataihoz</li><br /><li>Az Audi TT Roadster 1.8TFSi és 2.0TFSi modellekhez</li><br /><li>Nincs kompatibilis a Quattro változattal</li><br /><li>Elülső ültetési tartomány: 30-55mm között</li><br /><li>Hátsó ültetési tartomány: 20-50mm között</li><br /><li>A termék rendelkezik TÜV jóváhagyással</li><br /></ul><br />', 'V-Maxx Audi TT (Typ: 8J), beleértve Roadster, kivéve Quattro, 2006.07-2015.01-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-tt-typ-8j-beleertve-roadster-kiveve-quattro-2006-07-2015-01-ig-allithato-magassagu-futomu'),
(295, '', '<p><strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>\n<p>A <strong>MTS-Technik Sport sorozatú állítható magasságú sport futóművei</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóműveivel</strong> az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> optimális együttműködésben vannak, biztosítva ezzel a maximális vezetési élményt és széles ültetési tartományt.</p>\n<p>A következő típusokhoz:</p>\n<ul>\n	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>\n	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>\n	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li>\n	<li>Első tengely terhelés: 1036-1170kg</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n	<li>Ültetés mértéke elől: 35-70mm</li>\n	<li>Ültetés mértéke hátul: 35-60mm</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi TT (Typ: 8J), beleértve Quattro, 2006.08-2014.06-ig, (első tengely terhelés 966-1060kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8j-beleertve-quattro-2006-08-2014-06-ig-els-tengely-terheles-966-1060kg-sport-series-allithato-magassagu-futomu'),
(296, '', '<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futóművei</strong> ideális választás azok számára, akik nem akarnak kompromisszumot kötni! Az állítható magasságú futóművek fokozatmentesen állíthatók, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> tökéletes egyensúlyt teremtenek az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n<p>A következő típusokhoz:</p>\n<ul>\n	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>\n	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>\n	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li>\n	<li>Első tengely terhelés: 1035kg alatt</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n	<li>Ültetés mértéke elől: 35-70mm</li>\n	<li>Ültetés mértéke hátul: 35-60mm</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Audi TT (Typ: 8J), beleértve Quattro, 2006.08-2014.06-ig, (első tengely terhelés 965kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8j-beleertve-quattro-2006-08-2014-06-ig-els-tengely-terheles-965kg-alatt-sport-series-allithato-magassagu-futomu'),
(297, '', '<strong>Audi TT V-Maxx állítható magasságú és keménységű futómű</strong>\\n\\n<ul>\\n<li>Az Audi TT Coupé és Roadster modellekhez elérhető V-Maxx állítható futómű</li>\\n<li>Nem kompatibilis a Quattro változattal</li>\\n<li>A futómű keménysége 20 fokozatban szabályozható</li>\\n<li>Az ültetés mértéke elöl 30-55mm között, hátul pedig 20-50mm között állítható</li>\\n<li>A termék rendelkezik TÜV engedéllyel</li>\\n</ul>', 'V-Maxx Audi TT (Typ: 8J), beleértve Roadster, kivéve Quattro, 2006.07-2015.01-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-tt-typ-8j-beleertve-roadster-kiveve-quattro-2006-07-2015-01-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(298, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, lehetővé téve számukra, hogy a kívánt ültetést milliméterre pontosan beállítsák. Ennek eredményeképpen a sportos irányíthatóság és optimális vezetési élmény kombinációja érhető el a maximális ültetéssel összekapcsolva.</span></div> <div><span>Egy alumínium rugótányér segítségével a jármű magassága egyénileg beállítható a TÜV által engedélyezett tartományban belül, biztosítva ezzel a sportosságot, kényelmet és biztonságot egy optimális felépítés keretein belül.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Audi TT (Typ: 8J) Coupé, 4 hengeres, kivéve Quattro, 2006.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-tt-typ-8j-coupe-4-hengeres-kiveve-quattro-2006-09-tol-allithato-magassagu-futomu'),
(299, '', '<div>\n  <p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómű</strong> megfelel az alábbi autótípusnak:</p>\n  <ul>\n    <li>VW Golf 6, ideértve a GTI-t, melynek lengéscsillapító átmérője 55mm</li>\n    <li>Tipuskód: 1K, 1KP</li>\n    <li>Típusvariáció:</li>\n    <li>Évjárat: 2008.10-től</li>\n    <li>Tengelyterhelés elöl: 1060 kg, hátul: 1000 kg</li>\n    <li>Egyéb információk: Nem alkalmas négykerék-meghajtású modellekre!<br />Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetési tartomány: elöl 35-65 mm, hátul 35-65 mm között állítható<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n    <li>Extra ültetési lehetőség: elöl +10 mm, hátul +5 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: Made In Ap-Fahrwerke Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF81-031</strong></p>\n  <p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Audi TT (Typ: 8J) Coupé Quattro, 2006.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-tt-typ-8j-coupe-quattro-2006-09-tol-allithato-magassagu-futomu'),
(300, '', '<strong>Vogtland</strong> állítható magasságú futómű szett az AUDI TT modellekhez</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2006.09-től</li>\n	<li><strong>Ültetés mértéke:</strong> 20 - 40 mm</li>\n	<li><strong>Típus</strong>: Audi TT, Typ 8J, Coupé, Quattro, nem tartalmaz elektronikus lengéscsillapítót, a lengéscsillapító ház átmérője 55 mm</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1040 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 885 kg</li>\n	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf</a></li>\n</ul>\n<p>Az autó megjelenését javító Vogtland futómű szett teljes vezetési élményt nyújt. Az ültetés mértékét szabadon állíthatja saját igényei szerint. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A szett alapból 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművet használnak.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968188</p>', 'Vogtland Audi TT (Typ: 8J) Coupé Quattro, kivéve elektronikus lengéscsillapítóval szerelt, 2006.09-től állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8j-coupe-quattro-kiveve-elektronikus-lengescsillapitoval-szerelt-2006-09-tol-allithato-magassagu-futomu'),
(301, '', '<p><strong>Vogtland</strong><span> általános futómű beállító készlet</span>: AUDI TT</p> <ul>     <li><strong>Évjárat</strong>: 2007.04-től</li>     <li><strong>Ültetés mértéke:</strong> 20 - 50 mm</li>     <li><strong>Típus</strong>: Audi TT, Typ 8J, Roadster, 2WD, 4 hengeres, kivéve elektronikus lengéscsillapító, a lengéscsillapító ház átmérője 55 mm</li>     <li><strong>Max. tengelyterhelés elöl</strong>: 965 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li>     <li> </li> </ul> <p>Az autó megjelenésén javít, valamint növeli a vezetési élményt. A beállítások között testre szabhatja az ültetés magasságát. A készlet magas teljesítményű, kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel, ami kiegyensúlyozott kényelmet és fokozott dinamikát biztosít. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A készlet általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, ahol szintező- vagy torziós futóművet használnak.</p> <p>Németországban gyártva!</p> <p>Cikkszám: 968315</p>', 'Vogtland Audi TT (Typ: 8J) Roadster, 2WD, 4hengeres, 2007.04-től, 55 mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8j-roadster-2wd-4hengeres-2007-04-tol-55-mm-szaratmer-allithato-magassagu-futomu'),
(302, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: AUDI TT</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2006.09-től</li>\n    <li><strong>Ültetés mértéke:</strong> 20 - 50 / 20 - 50 mm</li>\n    <li><strong>Típus</strong>: Audi TT, Typ 8J, Coupé, 2WD, 4 hengeres, kivéve elektronikus lengéscsillapító, a lengéscsillapító ház átmérő 55 mm</li>\n    <li><strong>Max. tengelyterhelés elől</strong>: 965 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 885 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. Az ültetés mértékét személyre szabottan beállíthatja. Ez a kiváló minőségű futómű szett kizárólag speciális, kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően egyensúlyt teremtenek a komfort és a dinamika között. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968314</p>', 'Vogtland Audi TT (Typ: 8J) Coupé, 2WD, 4hengeres, 2006.09-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8j-coupe-2wd-4hengeres-2006-09-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(303, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett tökéletes választás az Audi TT számára, különösen a 2006.09-től gyártott modellekhez. Ez a futómű megfelelő ültetési mértéket biztosít a járműhöz, lehetővé téve az egyedi beállításokat. A készlet tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és dinamikus vezetési élményt nyújtanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók első osztályú korrózióvédelmet biztosítanak.</p>\n\n<p>Ez a minőségi termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett általában 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Ne felejtsd, hogy az elektronikusan szabályozható futóművel szerelt típusokhoz a deaktiváló szett szükséges, amelyet a csomag tartalmaz. A Vogtland futóművek minőségi német gyártmányúak, így biztos lehetsz benne, hogy a termék tartós és megbízható.</p>\n\n<p>Termék részletei: Cikkszám: 968295</p>', 'Vogtland Audi TT (Typ: 8J) Coupé, 4 hengeres, kivéve Quattro, csak elektronikus lengéscsillapító szabályzással, 2006.09-től állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8j-coupe-4-hengeres-kiveve-quattro-csak-elektronikus-lengescsillapito-szabalyzassal-2006-09-tol-allithato-magassagu-futomu'),
(304, '', '<p>A Vogtland állítható magasságú futómű szett az Audi TT modellekhez, kezdve a 2007.04-es évjárattól. Az ültetés mértéke 20-50 / 20-50 mm között változtatható. Ez a futómű kifejezetten az Audi TT, Typ 8J, Roadster, 2WD, 4 hengeres modellekhez lett tervezve, a lengéscsillapító ház átmérője 55 mm. Az elektronikusan szabályozható futóművel szerelt típusokhoz a deaktiváló szett tartozik a csomagban.</p>\n<p>Az első tengelyterhelés maximuma 965 kg, míg a hátsó tengelyterhelés maximuma 1150 kg. A futómű engedélyei megtalálhatók a <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf\" target=\"_blank\">hivatalos dokumentumban</a>.</p>\n<p>A Vogtland futómű szett nemcsak esztétikailag javítja az autó megjelenését, de maximalizálja a vezetési élményt is. A minőségi futómű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó teljesítményéhez.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968192</p>', 'Vogtland Audi TT (Typ: 8J) Roadster, 4 hengeres, kivéve Quattro, csak elektronikus lengéscsillapító szabályzással, 2007.04-től állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8j-roadster-4-hengeres-kiveve-quattro-csak-elektronikus-lengescsillapito-szabalyzassal-2007-04-tol-allithato-magassagu-futomu'),
(305, '', '<p>A Vogtland által készített állítható magasságú futómű szett az Audi TT modellekhez ideális választás. Az évjáratától függően 20-40 mm-es ültetést biztosít, a lengéscsillapító ház átmérője pedig 55 mm. Fontos tudni, hogy az elektronikusan szabályozható futóműveknél kiiktatás szükséges, de erről a csomag tartalmaz információt. Az előírt maximális tengelyterhelés elöl 1040 kg, hátul pedig 885 kg. A minőségi futómű szett kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel a kiegyensúlyozott komfort és dinamika érdekében. A lengéscsillapítók korrózióvédelme kiváló, így hosszú távon is megfelelő teljesítményt nyújtanak.</p>\n<p>A termék TÜV minősítéssel rendelkezik, a gyártó pedig 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat. Ne feledje, ez a minőségi termék Made in Germany!</p>\n<p>Cikkszám: 968296</p>', 'Vogtland Audi TT (Typ: 8J) Coupé Quattro, csak elektronikus lengéscsillapító szabályzással, 2006.09-től állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8j-coupe-quattro-csak-elektronikus-lengescsillapito-szabalyzassal-2006-09-tol-allithato-magassagu-futomu'),
(306, '', '<div><strong>Audi TT (Typ: 8N) Jom Blue Line állítható magasságú futómű</strong></div>\\r\\n\\r\\n<div>A típuskódja: 8N</div>\\r\\n\\r\\n<div>Gyártási éve: 1998.09 - 2006</div>\\r\\n\\r\\n<div>Csak elsőkerék meghajtású modellekhez alkalmas!!</div>\\r\\n\\r\\n<div>FONTOS! Ehhez a futóműhöz a rövidített stabilizátor rúd (kutyacsont) beszerelése ajánlott, ez nem része ennek a szettnek!!</div>\\r\\n\\r\\n<div>Első tengely terhelése: 1040 kg</div>\\r\\n\\r\\n<div>Hátsó tengely terhelése: 1000 kg</div>\\r\\n\\r\\n<div>GYÁRTVA NÉMETORSZÁGBAN</div>\\r\\n\\r\\n<div>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, amelyet a csomag tartalmaz.</div>\\r\\n\\r\\n<div>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</div>\\r\\n\\r\\n<div>Kiemelkedő minőség, rendkívül kedvező áron!!!</div>\\r\\n\\r\\n<div>A szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulccsal</div>', 'Jom Bochum Audi TT (Typ: 8N), kivéve Quattro, 1998.09-2006-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-tt-typ-8n-kiveve-quattro-1998-09-2006-ig-blue-line-allithato-magassagu-futomu'),
(307, '', '<div><strong>Audi TT Quattro Jom Blue Line futómű, melynek magassága állítható</strong></div>\\r\\n\\r\\n<div>Az autó típuskódja: 8N</div>\\r\\n\\r\\n<div>Gyártási évek: 1998 és 2006 között</div>\\r\\n\\r\\n<div>Ez a futómű speciálisan a Quattro típushoz készült</div>\\r\\n\\r\\n<div>Az állítható magasságú futómű hátsó tengelyénél a magasságállító a rugó alatt található</div>\\r\\n\\r\\n<div>FONTOS! A futómű beszereléséhez ajánlott egy rövidített stabilizátor rúd (kutyacsont), mely nem szerepel ebben a szettben</div>\\r\\n\\r\\n<div>Elülső tengely terhelése: 1050 kg</div>\\r\\n\\r\\n<div>Hátsó tengely terhelése: 1080 kg</div>\\r\\n\\r\\n<div>Gyártva Németországban</div>\\r\\n\\r\\n<div>Ez a futómű rendelkezik német TÜV engedéllyel, melyet a csomag tartalmaz</div>\\r\\n\\r\\n<div>2 év teljes körű garanciával!!!</div>\\r\\n\\r\\n<div>Kiemelkedő minőség, rendkívül kedvező áron!!!</div>\\r\\n\\r\\n<div>A szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és 1 db állítókulccsal</div>\\r\\n', 'Jom Bochum Audi TT (Typ: 8N) Quattro, 1998-2006-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-audi-tt-typ-8n-quattro-1998-2006-ig-blue-line-allithato-magassagu-futomu'),
(308, '', '<strong>Volkswagen Golf 4 MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  <p><u>A következő típuskhoz ideális:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Tartalmazza a Variant modelleket</li> 	<li>Kivéve a 4-Motion változatot</li> 	<li>Első tengely terhelése: 1030kg</li> 	<li>Hátsó tengely terhelése: 1025kg</li> </ul>  <p>Az <strong>MTS-Technik Comfort sorozatú állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik a sportos megjelenés mellett fontosnak tartják az utazási kényelmet! Könnyedén állítható magasságú futómű, így az autó hasmagassága könnyen igazítható az útviszonyokhoz! Az <strong>MTS-Technik Comfort sport futóművei</strong> optimálisak az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> közötti harmonikus együttműködés szempontjából.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> cég gyártja</li> 	<li>Különleges <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>A <strong>Comfort sorozat</strong> létrehozásakor nem a drasztikus leültetés volt a fókuszban, hanem a <strong>magas kényelem</strong></li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást a jármű felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>A weboldalon szereplő szöveges tartalmak és képek másolása vagy sokszorosítása engedély nélkül tilos!</em></p> ', 'MTS-Technik by Nord Performance Audi TT (Typ: 8N), kivéve Quattro, 1998.09-2006-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8n-kiveve-quattro-1998-09-2006-ig-comfort-series-allithato-magassagu-futomu'),
(309, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p><p><u>Termékjellemzők:</u></p><ul><li>A futómű rugóit az Eibach gyártja.</li><li>A magasság szabadon állítható általában 25 és 80 mm között.</li><li>Gáztöltésű lengéscsillapítók.</li><li>Magas hatékonyság extrém körülmények között is.</li><li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li><li>Rugó és lengéscsillapító tökéletes összhangja.</li><li>A készlet plug & play, nem szükséges módosítás az autó felfüggesztésén.</li></ul>', 'MTS-Technik by Nord Performance Audi TT (Typ: 8N) Quattro, 1998.09-2004-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8n-quattro-1998-09-2004-ig-allithato-magassagu-futomu'),
(310, '', '<div>\\n    <strong>Testreszabható magasságú futómű a Typ: 8N Audi TT modellekhez</strong>\\n</div>', 'V-Maxx Audi TT (Typ: 8N), kivéve Quattro, 1998.09-2006-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-tt-typ-8n-kiveve-quattro-1998-09-2006-ig-allithato-magassagu-futomu'),
(311, '', '<div> \\n<strong>Állítható magasságú felfüggesztéssel rendelkező Audi TT (Típus: 8N)</strong>', 'V-Maxx Audi TT (Typ: 8N) Quattro, 1998.09-2004-ig állítható magasságú futómű', '', '', '', 'v-maxx-audi-tt-typ-8n-quattro-1998-09-2004-ig-allithato-magassagu-futomu'),
(312, '', '<p><strong>Állítható magasságú sport futómű a Volkswagen Golf 4-hez</strong></p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Beleértve Variant</li> 	<li>Kivéve 4-Motion</li> 	<li>Első tengely terhelés: 1030kg</li> 	<li>Hátsó tengely terhelés: 1025kg</li> </ul>  <p>Az <strong>MTS-Technik Sport Series futóművei ideális választás azoknak, akik nem akarnak kompromisszumot kötni! Az állítható magasságú futómű könnyedén beállítható az útviszonyoknak megfelelően, így maximális vezetési élményt nyújt. Az <strong>MTS-Technik Sport futómű</strong> tökéletes összhangban van az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, ami széles ültetési tartományt eredményez.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>A <strong>Sport Series</strong> célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék karakterisztika:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Audi TT (Typ: 8N), kivéve Quattro, 1998.09-2006-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-8n-kiveve-quattro-1998-09-2006-ig-sport-series-allithato-magassagu-futomu'),
(313, '', '<div>\n<span style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nAudi TT (8N modell) V-Maxx rugózállítással\n</span>\n</div>', 'V-Maxx Audi TT (Typ: 8N) Quattro, 1998.09-2004-ig, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-tt-typ-8n-quattro-1998-09-2004-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(314, '', '<div>\n<p>Egy speciális futómű létezik, amelyet kifejlesztettek az Audi TT (Típus: 8N) modellhez, és lehetővé teszi a V-Maxx állítható magasság beállítását.</p>\n</div>', 'V-Maxx Audi TT (Typ: 8N), kivéve Quattro, 1998.09-2006-ig, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-audi-tt-typ-8n-kiveve-quattro-1998-09-2006-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(315, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméterre beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőségű termékek</li>\\r\\n</ul>\\r\\n', 'AP made by KW Audi TT (Typ: 8N) Quattro, 1999.06-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-tt-typ-8n-quattro-1999-06-tol-allithato-magassagu-futomu'),
(316, '', '<div>\n<p>Az AP-Fahrwerke Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>Volkswagen Golf 4</li>\n	<li>Tipuskód: 1J</li>\n	<li>Kivéve: 4-Motion és Variant</li>\n	<li>Évjárat: 1997.10-től</li>\n	<li>Tengelyterhelés elöl (kg): 1020</li>\n	<li>Tengelyterhelés hátul (kg): 1020</li>\n	<li>Egyéb kitételek: Az eredeti méretű abroncsok és felnik esetén nyomtávszélesítőre van szükség!<br />\n	Az 50 mm-nél nagyobb átmérőjű lengéscsillapítóval rendelkező modelleknél javasolt az anti-roll bar cseréje! Ez a cserélés a jobb oldali tengely szabad mozgásának növelését szolgálja, mivel az eredeti beállítások nem mindig biztosítanak elegendő helyet a futómű cseréje után. Az alkatrészek cikkszáma Xenon fényszóró nélküli modellekhez: ZB50-017, Xenon fényszórós modellekhez: ZB50-017.</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Extra ültetési lehetőség elöl: +45 mm, hátul: +5 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: GF10-005</strong></p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Audi TT (Typ: 8N), kivéve Quattro, 1998.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-tt-typ-8n-kiveve-quattro-1998-11-tol-allithato-magassagu-futomu'),
(317, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett:</span> AUDI TT</div>\n<ul>\n    <li><strong>Évjárat:</strong> 1999.06-2006</li>\n    <li><strong>Ültetés mértéke:</strong> 30 - 50 / 30 - 50 mm</li>\n    <li><strong>Típus:</strong> Audi TT, Typ 8N, Quattro</li>\n    <li><strong>Max. tengelyterhelés elöl:</strong> 1110 kg</li>\n    <li><strong>Max. tengelyterhelés hátul:</strong> 920 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét személyes igényeinek megfelelően állíthatja be. A készlet magas minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futómű van beépítve.</p>\n<p>Manufactured in Germany!</p>\n<p>Cikkszám: 968312</p>', 'Vogtland Audi TT (Typ: 8N) Quattro, 1999.06-2006-ig állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8n-quattro-1999-06-2006-ig-allithato-magassagu-futomu'),
(318, '', '<p><strong>Vogtland</strong><span> futómű szett kapható az AUDI TT modellhez.</span></p> <ul>     <li><strong>Évjárat</strong>: 1998.11-2006</li>     <li><strong>Ültetés mértéke:</strong> 30 - 50 / 30 - 50 mm</li>     <li><strong>Típus</strong>: Audi TT, Typ 8N, 2WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: 1030 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 845 kg</li>     <li> </li> </ul> <p>Az autó megjelenésén javítva további vezetési élményt nyújt. A beállítható ültetési magasság lehetővé teszi az egyéni igények szerinti testreszabást. A kiváló minőségű futómű szett speciális, nagy teljesítményű lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortérzetet és a dinamikus vezetést. A lengéscsillapítók első osztályú korrózióvédelemmel rendelkeznek.</p> <p>A termék TÜV minősítéssel rendelkezik. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968389</p>', 'Vogtland Audi TT (Typ: 8N), kivéve Quattro, 1998.11-2006-ig állítható magasságú futómű', '', '', '', 'vogtland-audi-tt-typ-8n-kiveve-quattro-1998-11-2006-ig-allithato-magassagu-futomu'),
(319, '', '<p><strong>Állítható magasságú sport futómű az Audi TT Jom Blueline számára</strong></p>\\r\\n\\r\\n<p><u>Ez a termék kompatibilis a következő Audi TT típusokkal:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Audi TT (Typ: FV) Coupé:</strong> 1.8 TFSI, 2.0 TFSI, 2.0 TFSI (TTS), 2.5 TFSI (TT RS), 2.0 TDI, 40 TFSI, 45 TFSI, TTS, TT RS</li>\\r\\n	<li><strong>Audi TT (Typ: FV) Roadster:</strong> 1.8 TFSI, 2.0 TFSI, 2.0 TFSI (TTS), 2.5 TFSI (TT RS), 2.0 TDI, 40 TFSI, 45 TFSI, TTS, TT RS</li>\\r\\n	<li><strong>Csak olyan típusokhoz, melyek Multilink futóművel vannak felszerelve</strong></li>\\r\\n	<li><strong>Kivétel Magnetic Ride Control rendszer</strong></li>\\r\\n	<li>Első tengely terhelésének maximális értéke: 1160 kg</li>\\r\\n	<li>Hátsó tengely terhelésének maximális értéke: 1250 kg</li>\\r\\n	<li>Elülső ültetés mértéke: 20-60 mm</li>\\r\\n	<li>Hátsó ültetés mértéke: 15-35 mm</li>\\r\\n	<li>Ez a termék rendelkezik TÜV engedéllyel!</li>\\r\\n	<li>Fontos figyelmeztetés: A beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott, de nem tartozék!</li>\\r\\n</ul>\\r\\n\\r\\n<p><em>Kérjük, ne másolja és ne sokszorosítsa ezt a terméket és annak tartalmát engedély nélkül!</em></p>\\r\\n', 'Jom Bochum Audi TT (Typ: FV), csak MultiLink futóművel szerelt, beleértve Quattro, 2014.07-2018-ig, (első tengely terhelés 1160kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-tt-typ-fv-csak-multilink-futomuvel-szerelt-beleertve-quattro-2014-07-2018-ig-els-tengely-terheles-1160kg-alatt-allithato-magassagu-futomu'),
(320, '', '<p><strong>Audi TT Jom Blueline állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p><u>Alkalmazható az alábbi típusokhoz:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Audi TT (Typ: FV) Coupé,</strong> többféle motorral és kivitellel</li>\\r\\n	<li><strong>Audi TT (Typ: FV) Roadster,</strong> különböző motorváltozatokkal</li>\\r\\n	<li><strong>Csak Multilink futóművel rendelkező modellekhez</strong></li>\\r\\n	<li><strong>Kivétel azok a járművek, melyekben Magnetic Ride Control található</strong></li>\\r\\n	<li>Első tengely terhelés: 1161-1200 kg</li>\\r\\n	<li>Hátsó tengely terhelés: kevesebb, mint 1250 kg</li>\\r\\n	<li>Elülső ültetés mértéke: 20-60 mm</li>\\r\\n	<li>Hátsó ültetés mértéke: 15-35 mm</li>\\r\\n	<li>Termék TÜV engedéllyel rendelkezik</li>\\r\\n	<li>Fontos! A beszereléshez ajánlott egy állítható hosszúságú stabilizátor szett (kutyacsont), amely nem része ennek a csomagnak</li>\\r\\n</ul>\\r\\n\\r\\n<p><em>Kérjük, vedd figyelembe, hogy a weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>\\r\\n', 'Jom Bochum Audi TT (Typ: FV), csak MultiLink futóművel szerelt, beleértve Quattro, 2014.07-2018-ig, (első tengely terhelés 1161-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-audi-tt-typ-fv-csak-multilink-futomuvel-szerelt-beleertve-quattro-2014-07-2018-ig-els-tengely-terheles-1161-1200kg-allithato-magassagu-futomu'),
(321, '', '<p>A MTS-Technik által gyártott állítható magasságú sport futóművek ideális választásnak számítanak azok számára, akik számára fontos a kiváló minőség és a versenyképes ár. A futóművek magassága folyamatosan szabályozható, lehetővé téve a könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóműveinek kialakításában optimális egyensúly van a rugók és a lengéscsillapítók között.</p> <p><u>Fontos jellemzők:</u></p> <ul> 	<li>A futóművek rugóit az Eibach cég gyártja</li> 	<li>A termék rendelkezik TÜV engedéllyel</li> 	<li>A magasságot általában 25 és 80 mm között lehet szabadon állítani</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugók és lengéscsillapítók tökéletes összhangban vannak egymással</li> 	<li>A készlet könnyen telepíthető, nem igényel változtatást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Audi TT (Typ: FV), csak MultiLink futóművel szerelt, beleértve Quattro, 2014.07-től, (első tengely terhelés 981-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-fv-csak-multilink-futomuvel-szerelt-beleertve-quattro-2014-07-tol-els-tengely-terheles-981-1180kg-allithato-magassagu-futomu'),
(322, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a magas minőséget és az megfizethető árakat. A rugalmas magasságbeállítás lehetővé teszi, hogy könnyedén alkalmazkodj az útviszonyokhoz, és szabályozd az autód hasmagasságát. Az MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Főbb Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> vállalat szállítja</li>\n	<li>Ezek a termékek rendelkeznek TÜV engedéllyel</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cinkréteg és fekete anódizált alumínium részek)</li>\n	<li>Rugalmas egyensúly a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Audi TT (Typ: FV), csak MultiLink futóművel szerelt, beleértve Quattro, 2014.07-től, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-audi-tt-typ-fv-csak-multilink-futomuvel-szerelt-beleertve-quattro-2014-07-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(323, '', '<p>Ez az állítható magasságú futóművet kínáló AP-Fahrwerke kiegészítő tökéletes választás az alábbi Audi TT Coupé és Roadster modellekhez, melyek tipuskódja FV és gyártásuk 2014.07-től kezdődött. Az első tengely terhelése 985kg alatt, míg a hátsó tengelyé 775kg alatt található. Fontos, hogy Quattro és Magnetic Ride Control rendszerrel felszerelt autókhoz nem ajánlott. A futómű beszereléséhez rövidített stabilizátor rúd szükséges, ami nem tartozék a készlethez. A futóműszett rendelkezik Német nyelvű TÜV engedéllyel, melyben meghatározott ültetési intervallumokat kell betartani: elöl 20-50 mm, hátsó 20-45 mm között állítható. Fontos tudni, hogy a futómű ennél nagyobb intervallumban is állítható, azonban a TÜV engedély csak a fenti beállításokra vonatkozik. Az AP-Fahrwerke futóműve Németországban készült, és 2 év garanciát vállalnak rá.</p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'AP made by KW Audi TT (Typ: FV), csak MultiLink futóművel szerelt, kivéve Quattro, 2014.07-től, (első tengely terhelés 985kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-tt-typ-fv-csak-multilink-futomuvel-szerelt-kiveve-quattro-2014-07-tol-els-tengely-terheles-985kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(324, '', 'Ez az állítható magasságú futómű illik az alábbi autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Audi TT Coupé és Roadster</li>\\r\\n	<li>Tipuskód: FV</li>\\r\\n	<li>Évjárat: 2014.07-től</li>\\r\\n	<li>Első tengely terhelés: 1095kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 920kg alatt</li>\\r\\n	<li>Kivéve Magnetic Ride Control</li>\\r\\n	<li>Csak Quattro</li>\\r\\n	<li>Fontos! A futómű beszereléséhez rövidített stabilizátor rúd ajánlott! A készlet NEM tartalmazza!</li>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-50 mm, hátul: 20-45 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n	<li>Készült Ap-Fahrwerke Németországban</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmainak, képeinek másolása, sokszorosítása engedély nélkül tilos!</em></p>\\r\\n', 'AP made by KW Audi TT (Typ: FV), csak MultiLink futóművel szerelt, csak Quattro, 2014.07-től, (első tengely terhelés 1095kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-audi-tt-typ-fv-csak-multilink-futomuvel-szerelt-csak-quattro-2014-07-tol-els-tengely-terheles-1095kg-alatt-allithato-magassagu-futomu'),
(325, '', '<strong>Bmw E21 MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Bmw E21, </strong>315 / 316 / 318 / 318 i / 320 / 320 i / 323 i</li>\\r\\n	<li><strong>Az ár tartalmaz 1pár állítható toronycsapágyat!</strong></li>\\r\\n	<li><strong>Szárátmérő: 51mm</strong></li>\\r\\n	<li>ültetés mértéke elöl: 20-90mm</li>\\r\\n	<li>ültetés mértéke hátul: 25-90mm</li>\\r\\n	<li>rugó erősség (első, fő rugó): 60 N/mm</li>\\r\\n	<li>rugó erősség (első, segéd rugó): 20 N/mm</li>\\r\\n	<li>rugó erősség (hátsó, fő rugó): 35 - 60 N/mm) N/mm</li>\\r\\n	<li>rugó erősség (hátsó, segéd rugó): 20 N/mm</li>\\r\\n	<li>első tengely terhelés: 865kg</li>\\r\\n	<li>hátsó tengely terhelés: 1030kg</li>\\r\\n	<li><strong>FIGYELEM! Az eredeti csonkálvány elküldése szükséges a gyártónak! Ennek szállítási költsége a vásárlót terheli! Kérem győződjön meg az alkatrész állapotáról, azt megfelelően csomagolva és megtisztítva küldje el!</strong></li>\\r\\n	<li><strong>TÜV engedéllyel rendelkezik!</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akiknek fontos a kiváló minőség és az kedvező ár! Fokozatmentesen állítható magasság lehetővé teszi, hogy az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően! Az MTS-Technik állítható futóművei a rugók és a lengéscsillapítók között tökéletes egyensúlyt biztosítanak. </p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li>\\r\\n	<li>gáztöltetű lengéscsillapítók</li>\\r\\n	<li>kiemelkedő hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Bmw E21, 315, 316, 318, 318i, 320, 320i, 323i, 1976.10-1982.10-ig, állítható toronycsapággyal, 51mm szárátmérő állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e21-315-316-318-318i-320-320i-323i-1976-10-1982-10-ig-allithato-toronycsapaggyal-51mm-szaratmer-allithato-magassagu-futomu'),
(326, '', '<p>Egy olyan futómű, amely tökéletes választás azoknak, akik fontosnak tartják a jó minőséget és a kedvező árat. A magasság fokozatmentesen állítható, így könnyedén lehet igazítani az autó hasmagasságát az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében.</li>\n	<li>Tökéletes egyensúly a rugó és a lengéscsillapító között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Bmw E21, 315, 316, 318, 318i, 320, 320i, 323i, 1976.10-1982.10-ig, állítható toronycsapággyal, 45mm szárátmérő állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e21-315-316-318-318i-320-320i-323i-1976-10-1982-10-ig-allithato-toronycsapaggyal-45mm-szaratmer-allithato-magassagu-futomu'),
(327, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\n<div> </div>\n<div>A Jom BlueLine futóművek széles körű minőséget képviselnek, mivel minden típusú futómű specifikus. Az autó magassága könnyedén módosítható a speciális állítókulcs segítségével a kiválasztott tartományon belül.</div>\n<div> </div>\n<div>- A termék rendelkezik 19.3 TÜV minősítéssel</div>\n<div>- Az EPS technológiával porfestett és horganyzott alkatrészekkel készül</div>\n<div> </div>\n<div>Ültetés mértéke elöl: 40 - 65 mm</div>\n<div>Ültetés mértéke hátul: 40 - 55 mm</div>', 'Jom Bochum Bmw E30 Cabrio, 316, 316i, 318i, 320i, 323i, 325i, 324D, TD, 1986.05-1993.05-ig, 51mm szárátmérő, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e30-cabrio-316-316i-318i-320i-323i-325i-324d-td-1986-05-1993-05-ig-51mm-szaratmer-blue-line-allithato-magassagu-futomu'),
(328, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómû</strong></div>\n<div> </div>\n<div>A Jom BlueLine futóművek kimagasló minőséget képviselnek, mindegyik típus egyedi tulajdonságokkal rendelkezik. Az autó magassága könnyedén változtatható az állítókulcs segítségével a megadott tartományon belül.</div>\n<div> </div>\n<div>- Rendelkezik 19.3 TÜV minősítéssel</div>\n<div>- Az EPS technológiával porfestett és horganyzott alkatrészekkel készül</div>\n<div> </div>\n<div>Elülső ültetés mértéke: 40 - 65 mm</div>\n<div>Hátsó ültetés mértéke: 40 - 55 mm</div>', 'Jom Bochum Bmw E30 Sedan és Coupé, 316, 316i, 318i, 320i, 323i, 325i, 324D, TD, 1982.11-1991.01-ig, 51mm szárátmérő, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e30-sedan-es-coupe-316-316i-318i-320i-323i-325i-324d-td-1982-11-1991-01-ig-51mm-szaratmer-blue-line-allithato-magassagu-futomu'),
(329, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>  \n<div> </div>  \n<div>A BlueLine sportfutóművek kiváló minőséget képviselnek, mindegyik típus egyedi jellemzőkkel rendelkezik. Az autó magassága könnyedén állítható egy speciális kulccsal a megadott tartományon belül.</div>  \n<div> </div>  \n<div>- Az alkatrészek EPS technológiával porfestettek és horganyzottak</div>  \n<div>- TÜV minősítéssel büszkélkedhet</div>  \n<div> </div>  \n<div>Ültetés mértéke elöl: 40 - 65 mm</div>  \n<div>Ültetés mértéke hátul: 40 - 55 mm</div> ', 'Jom Bochum Bmw E30 Touring, 316, 316i, 318i, 320i, 323i, 325i, 324D, TD, 1988-1995.03-ig, 51mm szárátmérő, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e30-touring-316-316i-318i-320i-323i-325i-324d-td-1988-1995-03-ig-51mm-szaratmer-blue-line-allithato-magassagu-futomu'),
(330, '', '<div>\\n    <div>A Bmw E30 típushoz készült futómű erősített változata.</div>\\n</div>', 'V-Maxx Bmw E30, kivéve M3 és iX, 1982.11-1991.01-ig, 51mm-es szárátmérővel, (első tengely terhelés 835kg fölött) állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e30-kiveve-m3-es-ix-1982-11-1991-01-ig-51mm-es-szaratmervel-els-tengely-terheles-835kg-folott-allithato-magassagu-futomu'),
(331, '', 'Az V-Maxx állítható magasságú futómű speciálisan a BMW E30 modellhez készült. A futómű 51mm átmérőjű szárral rendelkezik, azonban nem használható az iX modellekhez. Amennyiben az autó M-Technik futóművel van felszerelve, az ültetési tartomány 20mm-el kisebb lesz. Az első tengely maximális terhelése 835kg, az elülső ültetés mértéke pedig 40-80mm, míg a hátsó ültetés mértéke 40-65mm lehet. Fontos tudni, hogy ez a termék rendelkezik TÜV engedéllyel, így biztos lehet benne, hogy megfelel az előírásoknak.', 'V-Maxx Bmw E30, kivéve M3 és iX, 1982.11-1991.01-ig, 51mm-es szárátmérővel, (első tengely terhelés 835kg alatt) állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e30-kiveve-m3-es-ix-1982-11-1991-01-ig-51mm-es-szaratmervel-els-tengely-terheles-835kg-alatt-allithato-magassagu-futomu'),
(332, '', '<p>Az MTS-Technik Street állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár. A futóművek fokozatmentesen állítható magassággal rendelkeznek, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és lengéscsillapítók optimális egyensúlyát biztosítják.</p> <p><u>Ez a termék tökéletesen illik a következő típusokhoz:</u></p> <ul> 	<li><strong>BMW E30 Sedan</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li> 	<li><strong>BMW E30 Coupé</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li> 	<li><strong>BMW E30 Touring</strong>, 316i / 318i / 320i / 325i / 324td</li> 	<li><strong>BMW E30 Cabrio</strong>, 318i / 320i / 325i</li> 	<li><strong>Az ár tartalmaz 1 pár állítható toronycsapágyat!</strong></li> 	<li><strong>Szárátmérő:</strong> 45mm</li> 	<li>Ültetés mértéke elöl: 25-90mm</li> 	<li>Ültetés mértéke hátul: 25-60mm</li> 	<li>Első tengely terhelés: 865kg</li> 	<li>Hátsó tengely terhelés: 1030kg</li> 	<li>Kivéve 4WD modellek</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> cég gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 45mm szárátmérő, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-1982-11-1993-05-ig-allithato-toronycsapaggyal-45mm-szaratmer-street-series-allithato-magassagu-futomu'),
(333, '', '<p>Az MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem is. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Comfort futóművei tökéletes harmóniát képviselnek az Eibach rugók és MTS-Technik lengéscsillapítók között.</p>\n\n<p><u>A következő modellekhez ajánlott:</u></p>\n<ul>\n	<li>BMW E30 Sedan, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li>BMW E30 Coupé, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li>BMW E30 Touring, 316i / 318i / 320i / 325i / 324td</li>\n	<li>BMW E30 Cabrio, 318i / 320i / 325i</li>\n	<li>Az ár tartalmaz 1pár állítható toronycsapágyat!</li>\n	<li>Szárátmérő: 45mm</li>\n	<li>Ültetés mértéke elől: 25-90mm</li>\n	<li>Ültetés mértéke hátul: 25-60mm</li>\n	<li>Elülső tengely terhelés: 865kg</li>\n	<li>Hátsó tengely terhelés: 1030kg</li>\n	<li>Kivéve 4WD modellek</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort sorozat létrehozásakor hangsúlyt fektettek a magas komfortra</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>  \n\n<p><u><strong>Termék karakterisztika:</strong></u></p>  \n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 45mm szárátmérő, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-1982-11-1993-05-ig-allithato-toronycsapaggyal-45mm-szaratmer-comfort-series-allithato-magassagu-futomu'),
(334, '', '<p>A <strong>MTS-Technik Comfort Series állítható magasságú sport futómű</strong> ideális választás azoknak, akik szeretnék kombinálni a sportos megjelenést a kiváló utazási kényelemmel! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az <strong>MTS-Technik Comfort futóműveknél</strong> az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> optimális együttműködésben vannak.</p>\n\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n<li><strong>BMW E30 Sedan</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n<li><strong>BMW E30 Coupé</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n<li><strong>BMW E30 Touring</strong>, 316i / 318i / 320i / 325i / 324td</li>\n<li><strong>BMW E30 Cabrio</strong>, 318i / 320i / 325i</li>\n<li><strong>Az ár egy pár állítható toronycsapágyat tartalmaz!</strong></li>\n<li><strong>Szár átmérője:</strong> 51mm</li>\n<li>Elülső ültetés: 25-90mm</li>\n<li>Hátsó ültetés: 25-60mm</li>\n<li>Elülső tengely terhelése: 865kg</li>\n<li>Hátsó tengely terhelése: 1030kg</li>\n<li>Kivéve a 4WD modelleket</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n<li>A rugókat az <strong>Eibach</strong> gyártja</li>\n<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n<li>A <strong>Comfort Series</strong> létrehozásakor nem az extrém ültetésre, hanem a <strong>kiemelt kényelemre</strong> helyezték a hangsúlyt</li>\n<li>Gáztöltéses lengéscsillapítók</li>\n<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink és fekete anódizált alumínium alkatrészek)</li>\n<li>Kitűnő összhang a rugók és lengéscsillapítók között</li>\n<li>A készlet plug & play, nem igényel módosítást a jármű felfüggesztésén</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 51mm szárátmérő, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-1982-11-1993-05-ig-allithato-toronycsapaggyal-51mm-szaratmer-comfort-series-allithato-magassagu-futomu'),
(335, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport futóművei optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között. A maximális vezetési élmény érdekében széles ültetési tartomány biztosított.</p>\n\n<p><u>A következő típusokhoz ajánlott:</u></p>\n<ul>\n	<li>BMW E30 Sedan, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li>BMW E30 Coupé, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li>BMW E30 Touring, 316i / 318i / 320i / 325i / 324td</li>\n	<li>BMW E30 Cabrio, 318i / 320i / 325i</li>\n	<li>Az ár tartalmaz 1 pár állítható toronycsapágyat!</li>\n	<li>Szárátmérő: 51mm</li>\n	<li>Ültetés mértéke elöl: 25-90mm</li>\n	<li>Ültetés mértéke hátul: 10-50mm</li>\n	<li>Első tengely terhelés: 865kg</li>\n	<li>Hátsó tengely terhelés: 1030kg</li>\n	<li>Kivéve 4WD modellek</li>\n	<li>Letölthető dokumentum: <a href=\"https://mtstechnik.com/data/links/38557aa6b1da340c8df5d945c52af06c/36159_7325.pdf\"><span>szerelési útmutató</span></a></li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 51mm szárátmérő, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-1982-11-1993-05-ig-allithato-toronycsapaggyal-51mm-szaratmer-sport-series-allithato-magassagu-futomu'),
(336, '', '<strong>Állítható magasságú sport futómű a BMW E30 számára</strong></p>  <p>Az állítható magasságú sport futóművek ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága. Az Eibach rugók és az MTS-Technik lengéscsillapítók optimális együttműködésének köszönhetően maximális vezetési élményt nyújtanak.</p>  <p><u>Az alábbi típusokhoz passzol:</u></p>  <ul> 	<li>BMW E30 Sedan, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li> 	<li>BMW E30 Coupé, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li> 	<li>BMW E30 Touring, 316i / 318i / 320i / 325i / 324td</li> 	<li>BMW E30 Cabrio, 318i / 320i / 325i</li> 	<li>Az ár tartalmaz 1 pár állítható toronycsapágyat</li> 	<li>Szármérő: 45mm</li> 	<li>Ültetés mértéke elöl: 25-90mm</li> 	<li>Ültetés mértéke hátul: 10-50mm</li> 	<li>Elülső tengely terhelés: 865kg</li> 	<li>Hátsó tengely terhelés: 1030kg</li> 	<li>Kivéve 4WD modellek</li> 	<li>Letölthető dokumentum: <strong><a href=\\\"https://mtstechnik.com/data/links/38557aa6b1da340c8df5d945c52af06c/36159_7325.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók a maximális sportosság érdekében</li> 	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a fő szempont</li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék karakterisztika:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek másolása, sokszorosítása tilos a szerző engedélye nélkül!</em></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 45mm szárátmérő, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-1982-11-1993-05-ig-allithato-toronycsapaggyal-45mm-szaratmer-sport-series-allithato-magassagu-futomu'),
(337, '', '<strong>Bmw E30 MTS-Technik Street Series állítható magasságú Inox sport futómű</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik számára fontos a minőség és az elérhető ár! A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között. Az első lengéscsillapítók INOX bevonattal vannak ellátva!</p>  <p><u>Alábbi típusokhoz illeszkedik:</u></p>  <ul> 	<li><strong>BMW E30 Sedan</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li> 	<li><strong>BMW E30 Coupé</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li> 	<li><strong>BMW E30 Touring</strong>, 316i / 318i / 320i / 325i / 324td</li> 	<li><strong>BMW E30 Cabrio</strong>, 318i / 320i / 325i</li> 	<li><strong>Az ár tartalmaz 1pár első MTS-Technik Motorsport állítható toronycsapágyat!</strong></li> 	<li><strong>Szárátmérő: 51</strong>mm</li> 	<li>Ültetés mértéke elöl: 25-90mm</li> 	<li>Ültetés mértéke hátul: 25-60mm</li> 	<li>Első tengely terhelés: 865kg</li> 	<li>Hátsó tengely terhelés: 1030kg</li> 	<li>Rugó erősség (első, fő rugó): 60 N/mm</li> 	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li> 	<li>Rugó erősség (hátsó, fő rugó): 46 - 90,1 N/mm</li> 	<li>kivéve 4WD modellek</li> 	<li>TÜV engedéllyel NEM rendelkezik!</li> </ul>  <p><u>Bmw E30 MTS Technik Motorsport első állítható toronycsapágy jellemzői:</u></p>  <ul> 	<li>Hasmagasság csökkenés: 20 mm</li> 	<li>Állíthatóság: -2.5°, +0.5°</li> 	<li>Gyári futóműhöz NEM passzol</li> 	<li>Toronycsapágy tömege: 840g</li> 	<li>Az MTS Technik állítható toronycsapágyak lehetővé teszik a kerék dőlés állítását</li> 	<li>A kerék dőlés pontos beállítása javítja az autó vezethetőségét, csökkenti a gumi kopást</li> 	<li>Minden MTS Technik állítható toronycsapágy anyaga alumínium ötvözet</li> 	<li>Az MTS Technik toronycsapágyak CNC technológiával készülnek</li> 	<li>Minden állítható toronycsapágy erősített G-szemmel van ellátva a hosszú élettartam érdekében</li> 	<li>Az MTS Technik állítható toronycsapágyak a legtöbb forgalomban lévő állítható magasságú futóművel kompatibilisek!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li> 	<li>gáztöltetes lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék karakterisztika:</strong></u></p>  <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 51mm szárátmérő, Street Series, Inox állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-1982-11-1993-05-ig-allithato-toronycsapaggyal-51mm-szaratmer-street-series-inox-allithato-magassagu-futomu'),
