(341, '', '<p><strong>Az MTS-Technik Comfort Series állítható magasságú sport futómű</strong></p>\n\n<p><u>A megfelelő típusok:</u></p>\n\n<ul>\n	<li><strong>BMW E30 Sedan</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li><strong>BMW E30 Coupé</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li><strong>BMW E30 Touring</strong>, 316i / 318i / 320i / 325i / 324td</li>\n	<li><strong>BMW E30 Cabrio</strong>, 318i / 320i / 325i</li>\n	<li><strong>A csomag tartalmaz 1 pár állítható toronycsapágyat!</strong></li>\n	<li><strong>Szár átmérője:</strong> 51 mm</li>\n	<li>Ültetés mértéke elöl: 25-90 mm</li>\n	<li>Ültetés mértéke hátul: 25-60 mm</li>\n	<li>Rugó erősség (első, fő rugó): 50 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 46 - 90,1 N/mm</li>\n	<li>Első tengely terhelés: 865 kg</li>\n	<li>Hátsó tengely terhelés: 1030 kg</li>\n	<li>Kivéve 4WD modellek</li>\n	<li><strong>FONTOS! Az eredeti csonkálvány visszaküldése szükséges a gyártónak! A szállítási költségek a vásárlót terhelik! Kérjük, győződjön meg az alkatrész állapotáról, és megfelelően csomagolva és megtisztítva küldje vissza!</strong></li>\n</ul>\n\n<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés és az utazási kényelem egyaránt! A fokozatmentesen állítható magasságnak köszönhetően könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik Comfort állítható futóművei a legjobb összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművekhez tartozó rugókat az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort Series létrehozásakor nem az extrém ültetés, hanem a magas kényelem volt a fókuszban</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 51mm szárátmérő, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-198211-199305-ig-allithato-toronycsapaggyal-51mm-szaratmero-comfort-series-allithato-magassagu-futomu-2'),
(342, '', '<p><strong>Az MTS-Technik Comfort állítható magasságú sport futómű</strong> tökéletes megoldás azoknak, akik szeretnék kombinálni a sportos megjelenést az utazási kényelemmel. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az Eibach rugók és az MTS-Technik lengéscsillapítók optimális együttműködést biztosítanak.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>Az állítható magasságú futóművekhez Eibach rugók tartoznak.</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében.</li>\n	<li>A Comfort Series tervezése során a hangsúly a magas kényelemre került, nem az extrém ültetésre.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém terhelés mellett is.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében.</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást a felfüggesztésben.</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 45mm szárátmérő, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-198211-199305-ig-allithato-toronycsapaggyal-45mm-szaratmero-comfort-series-allithato-magassagu-futomu-2'),
(343, '', '<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futóművei</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága fokozatmentesen. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>A termék kompatibilis a következő típusokkal:</u></p>\n\n<ul>\n	<li><strong>BMW E30 Sedan</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li><strong>BMW E30 Coupé</strong>, 315 / 316 / 316i / 318i / 318is / 320i / 323i / 325i / 325e / 324d / 324td</li>\n	<li><strong>BMW E30 Touring</strong>, 316i / 318i / 320i / 325i / 324td</li>\n	<li><strong>BMW E30 Cabrio</strong>, 318i / 320i / 325i</li>\n	<li>Az ár tartalmaz 1 pár állítható toronycsapágyat</li>\n	<li>Szárátmérő: 51 mm</li>\n	<li>Ültetés mértéke elöl: 25-90 mm</li>\n	<li>Ültetés mértéke hátul: 10-50 mm</li>\n	<li>Rugó erősség (első, fő rugó): 80 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 260 N/mm</li>\n	<li>Rugó erősség (hátsó, segéd rugó): 20 N/mm</li>\n	<li>Első tengely terhelés: 865 kg</li>\n	<li>Hátsó tengely terhelés: 1030 kg</li>\n	<li>Kivéve 4WD modellek</li>\n	<li>FIGYELEM! Az eredeti csonkálvány elküldése szükséges a gyártónak. Ennek szállítási költsége a vásárlót terheli. Kérjük, győződjön meg az alkatrész állapotáról, azt megfelelően csomagolva és megtisztítva küldje el.</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>\n	<li>A <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E30, összes, kivéve M3 és iX, 1982.11-1993.05-ig, állítható toronycsapággyal, 51mm szárátmérő, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e30-osszes-kiveve-m3-es-ix-198211-199305-ig-allithato-toronycsapaggyal-51mm-szaratmero-sport-series-allithato-magassagu-futomu-2'),
(345, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A BlueLine sportfutóművek kiemelkedő minőséget képviselnek, mindegyik típus egyedi jellemzőkkel rendelkezik. Az autó magassága könnyedén módosítható egy speciális állítókulcs segítségével a megadott tartományon belül.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>- Rendelkezik 19.3 TÜV minősítéssel</div>\\r\\n\\r\\n<div>- A porfestett és horganyzott alkatrészek EPS technológiával készülnek</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az ültetés mértéke elöl: 40 - 60 mm</div>\\r\\n\\r\\n<div>Az ültetés mértéke hátul: 30 - 55 mm</div>', 'Jom Bochum Bmw E34 Sedan, 518i, 520i, 1990-1996-ig, (M14/D14 menet), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e34-sedan-518i-520i-1990-1996-ig-m14d14-menet-blue-line-allithato-magassagu-futomu'),
(346, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div> <div> </div> <div>A Jom BlueLine sportfutóművek kiemelkedő minőséget képviselnek, mindegyik típus specifikus jellemzőkkel rendelkezik. Az autó magassága könnyedén módosítható a speciális állítókulcs segítségével az állítási tartományon belül.</div> <div> </div> <div>- Rendelkezik 19.3 TÜV minősítéssel</div> <div>- Az EPS technológiával készült alkatrészek porfestéssel és horganyzással vannak ellátva</div> <div> </div> <div>Az ültetés mértéke az elülső részen: 40 - 60 mm</div>', 'Jom Bochum Bmw E34 Touring, 518i, 520i, 525i, 1991-1996-ig, (M14/D14 menettel), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e34-touring-518i-520i-525i-1991-1996-ig-m14d14-menettel-blue-line-allithato-magassagu-futomu'),
(347, '', '<!DOCTYPE html>\n<html>\n<head>\n<title>Kategória leírás átírása</title>\n</head>\n<body>\n<h2>Autókategória</h2>\n<p>Az autókategória olyan járműveket foglal magában, amelyek motorral működnek és általában négy kerékkel rendelkeznek. Ezek a járművek széles körben használtak a szállításban, közlekedésben és szabadidős tevékenységekben is. Az autókategória különböző típusai közé tartoznak a személyautók, teherautók, terepjárók, sportautók és egyéb speciális járművek.</p>\n<p>Az autókategória fontos szerepet játszik a mindennapi életben, hiszen lehetővé teszi az emberek számára, hogy gyorsan és hatékonyan közlekedjenek. Emellett hozzájárul a gazdaság fejlődéséhez is, mivel fontos szereplője a szállítási és logisztikai iparágnak.</p>\n</body>\n</html>', 'Jom Bochum Bmw E34 Touring, 520D, 524D, 525D, 525TD, 525TDS, 530i, 1991-1996-ig, (M14/D16 menettel), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e34-touring-520d-524d-525d-525td-525tds-530i-1991-1996-ig-m14d16-menettel-blue-line-allithato-magassagu-futomu'),
(348, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A BlueLine sportfutóművek emelkedett minőséget képviselnek, melyek mindegyike típusspecifikus. Az autó magassága könnyedén változtatható a speciális állítókulcs segítségével az állítási tartományon belül.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>- Rendelkezik 19.3 TÜV minősítéssel</div>\\r\\n\\r\\n<div>- Az EPS technológiával porfestett és horganyzott alkatrészekkel készül</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső ültetés mértéke: 40 - 60 mm</div>\\r\\n\\r\\n<div>Hátsó ültetés mértéke: 30 - 55 mm</div>', 'Jom Bochum Bmw E34 Sedan, 525i, 530i, 540i, 524TD, 524TDS, 1990-1996-ig, (M14/D16 menet), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e34-sedan-525i-530i-540i-524td-524tds-1990-1996-ig-m14d16-menet-blue-line-allithato-magassagu-futomu'),
(349, '', '<div>\n<p>Ez a JOM BlueLine Állítható magasságú futómű tökéletesen illeszkedik az alábbi autótípushoz:</p>\n\n<p><strong>BMW E36 Kombi</strong><br />\nTipuskód: E36<br />\nVáltozat: 318I / 318TDS / 320i / 323i / 325i / 328i / 325TD / 325TDS<br />\nÉvjárat: 1995.05 - 2000<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\n<strong>BMW E36 Szedán</strong><br />\nKivéve: M3<br />\nTipuskód: E36<br />\nVáltozat: 316i/ 318i/ 318TDS/ 320i / 323i / 325i / 328i / 325TD / 325TDS<br />\nÉvjárat: 1992.06 - 1998<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\n<strong>BMW E36 Kabrió</strong><br />\nKivéve: M3<br />\nTipuskód: E36<br />\nVáltozat: 318i/ 320i/ 323i/ 325i/ 328i<br />\nÉvjárat: 1993 - 1998<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\n<strong>BMW E36 Coupé</strong><br />\nKivéve: M3<br />\nTipuskód: E36<br />\nVáltozat: 316i/ 318i/ 318TDS/ 320i / 323i / 325i / 328i / 325TD / 325TDS<br />\nÉvjárat: 1992.06 - 1998<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\nEz a futóműszett rendelkezik német nyelvű TÜV engedéllyel!<br />\nAz engedélyben meghatározott ültetés mértéke elöl: 40-80mm, hátul: 30-60mm között változtatható<br />\n(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)<br />\nMade In JOM Németország<br />\nCikkszáma: 741004</p>\n</div>\n\n<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\n\n<div> </div>\n\n<div>A BlueLine állítható magasságú futóművek kiváló minőséget képviselnek, mindegyik futómű típus-specifikus. Az autó magassága egy állítási tartományon belül a speciális állítókulcs segítségével szabadon módosítható.</div>\n\n<div> </div>\n\n<div>- 19.3 TÜV minősítéssel rendelkezik</div>\n\n<div>- EPS technológiával porfestett, valamint horganyzott alkatrészekkel</div>', 'Jom Bochum Bmw E36, kivéve Compact és M3, 1992-2000-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e36-kiveve-compact-es-m3-1992-2000-ig-blue-line-allithato-magassagu-futomu'),
(350, '', 'Adj meg egy kategória leírását HTML formátumban, amit át tudok fogalmazni neked!', 'Jom Bochum Bmw E36 Compact, 1994.04-1998.04-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e36-compact-1994-04-1998-04-ig-blue-line-allithato-magassagu-futomu'),
(351, '', '<div>\n<p>Ez a JOM BlueLine Állítható magasságú futómű tökéletes választás az alábbi autótípusokhoz:</p>\n\n<p><strong>BMW E36 Touring</strong><br />\nTipuskód: E36<br />\nVáltozat: 318I / 318TDS / 320i / 323i / 325i / 328i / 325TD / 325TDS<br />\nÉvjárat: 1995.05 &ndash; 2000<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\n<strong>BMW E36 Sedan</strong><br />\nKivéve: M3<br />\nTipuskód: E36<br />\nVáltozat: 316i/ 318i/ 318TDS/ 320i / 323i / 325i / 328i / 325TD / 325TDS<br />\nÉvjárat: 1992.06 &ndash; 1998<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\n<strong>BMW E36 Cabrio</strong><br />\nKivéve: M3<br />\nTipuskód: E36<br />\nVáltozat: 318i/ 320i/ 323i/ 325i/ 328i<br />\nÉvjárat: 1993 &ndash; 1998<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\n<strong>BMW E36 Coupé</strong><br />\nKivéve: M3<br />\nTipuskód: E36<br />\nVáltozat: 316i/ 318i/ 318TDS/ 320i / 323i / 325i / 328i / 325TD / 325TDS<br />\nÉvjárat: 1992.06 &ndash; 1998<br />\nTengelyterhelés elöl (kg): 890<br />\nTengelyterhelés hátul (kg): 1025</p>\n\n<p><br />\nEz a futóműszett rendelkezik német nyelvű TÜV engedéllyel!<br />\nAz engedélyben meghatározott ültetés mértéke elöl: 40-80mm, hátul: 30-60mm között állítható<br />\n(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)<br />\nMade In JOM Németország<br />\nCikkszáma: 741004</p>\n</div>\n\n<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\n\n<div> </div>\n\n<div>A BlueLine állítható magasságú futóművek kiemelkedő minőséget képviselnek, mindegyik futómű típusspecifikus. Az autó magassága egy meghatározott tartományon belül a speciális állítókulcs segítségével szabadon változtatható.</div>\n\n<div> </div>\n\n<div>- 19.3 TÜV minősítéssel büszkélkedhet</div>\n\n<div>- EPS technológiával porfestett, valamint horganyzott alkatrészekkel</div>', 'Jom Bochum Bmw E36, kivéve Compact és M3, 1992-2000-ig, Blue Line, toronycsapágyakkal állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e36-kiveve-compact-es-m3-1992-2000-ig-blue-line-toronycsapagyakkal-allithato-magassagu-futomu'),
(352, '', '<p>Állítható magasságú FK-Automotive AK Street futómű, melyet BMW (Typ E36) modellekhez terveztek 1992 és 1999 közötti évekre. Nem kompatibilis Compact és M3 változatokkal.</p>\n\n<ul>\n	<li>A futómű ültetése 40 - 80 mm között állítható</li>\n	<li>Elöl és hátul is változtatható a magassága</li>\n	<li>Széles intervallumban szabályozható a magassága</li>\n	<li>Sportos, stabil és tartós kivitel</li>\n	<li>Német TÜV engedéllyel rendelkezik</li>\n	<li>Anyaga: Acél</li>\n</ul>', 'FK-Automotive Bmw E36, kivéve Compact, M3, 1992-2000-ig állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e36-kiveve-compact-m3-1992-2000-ig-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(353, '', '<strong>Bmw E36 Compact V-Maxx állítható magasságú futómû</strong>\\n\\n<ul>\\n<li>Az állítható magasságú futóművet a Compact 316i / 318i / 318TDS / 318Ti / 323Ti modellekhez tervezték.</li>\\n<li>Csak a Compact típusokhoz alkalmas.</li>\\n<li>Az ültetés mértéke az első részen 40-80mm között, míg a hátsó részen 30-60mm között változtatható.</li>\\n<li>Ez a futómű megfelel a TÜV által kiadott engedélynek.</li>\\n</ul>', 'V-Maxx Bmw E36 Compact, 1994.04-1998.04-ig állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e36-compact-1994-04-1998-04-ig-allithato-magassagu-futomu'),
(354, '', '<div>\\n<p>Egy olyan sport futómű, melyet az autó magasságának állítására terveztek, kifejezetten a Bmw E36 modellhez.</p>\\n</div>', 'V-Maxx Bmw E36, kivéve Compact és M3, 1992-2000-ig állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e36-kiveve-compact-es-m3-1992-2000-ig-allithato-magassagu-futomu'),
(355, '', '<p>A MTS-Technik által készített állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árat. A futómű magassága fokozatmentesen módosítható, így könnyedén alkalmazkodik az útviszonyokhoz, lehetővé téve az autó alváza számára ideális magasság beállítását. Az MTS-Technik futóművei kiváló összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság széles skálán, legtöbb esetben 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangja</li>\n	<li>Plug & Play készlet, nem igényel módosítást a felfüggesztésben</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw E36 Compact, 1994.01-2000.08-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e36-compact-1994-01-2000-08-ig-street-series-allithato-magassagu-futomu'),
(356, '', 'Hiba történt az API hívás során', 'MTS-Technik by Nord Performance Bmw E36, kivéve Compact és M3, 1990-2000-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e36-kiveve-compact-es-m3-1990-2000-ig-street-series-allithato-magassagu-futomu'),
(357, '', '<strong>Állítható Magasságú és Rugalmas Futómű a BMW E36 FK-Automotive-tól</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autó típusa: E36 Cabrio</li>\\r\\n	<li>Évjárat: 1992-1999</li>\\r\\n	<li>Kivétel: M3</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Az ültetés magassága 40 - 80 mm között módosítható</li>\\r\\n	<li>Első tengely terhelése: 920kg</li>\\r\\n	<li>Hátsó tengely terhelése: 1150kg</li>\\r\\n	<li>A futómű magassága elől és hátul is állítható</li>\\r\\n	<li><strong>Állítható rugalmasságú kialakítás!</strong></li>\\r\\n	<li>Széles tartományban módosítható a magassága</li>\\r\\n	<li>Sportos, dinamikus és tartós</li>\\r\\n	<li>Német nyelvű TÜV jóváhagyással rendelkezik</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E36 Cabrio, 1992-1999-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e36-cabrio-1992-1999-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(358, '', '<p>Egy olyan futómű, amelynek magassága és keménysége is állítható, kifejezetten az E36 Sedan és Touring típusú autókhoz tervezve (1992-1999 közötti években gyártott modellekhez, kivéve a M3-at). Az ültetés mértéke 40 - 80 mm között állítható, mindkét tengely terhelése szabályozható (920kg az elsőn, 1150kg a hátsón). A futómű sportos, feszes és strapabíró, nagy intervallumban lehet állítani a magasságát. Emellett rendelkezik német nyelvű TÜV engedéllyel, anyaga pedig acél.</p>', 'FK-Automotive Bmw E36 Sedan és Touring, 1992-1999-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e36-sedan-es-touring-1992-1999-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(359, '', '<p><strong>FK-Automotive Állítható Magasságú és Keménységű Futómű a BMW E36 Coupé modellekhez</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: E36 Coupé</li>\\r\\n	<li>Évjárat: 1992-1999</li>\\r\\n	<li>Kivéve: M3</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű ültetésének széles skálájában állítható, lehetőség van 40 - 80 mm-es tartományban történő beállításra</li>\\r\\n	<li>Első tengely terhelési limit: 920kg</li>\\r\\n	<li>Hátsó tengely terhelési limit: 1150kg</li>\\r\\n	<li>A futómű magassága mind elöl, mind hátul könnyedén állítható</li>\\r\\n	<li><strong>A futómű keménysége szintén szabályozható</strong></li>\\r\\n	<li>Nagyfokú rugalmasság a magasság beállításában</li>\\r\\n	<li>Sportos, dinamikus és erős kivitel</li>\\r\\n	<li>Minőségi, német nyelvű TÜV engedéllyel rendelkezik</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E36 Coupé, 1992-1999-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e36-coupe-1992-1999-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(360, '', '<strong>MTS-Technik Comfort Series állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>BMW E36 Compact</strong> modellekhez</li> 	<li>Gyártási időszak: 1994.01-2000.08</li> 	<li>Elülső ültetés: 20-90mm</li> 	<li>Hátsó ültetés: 10-40mm</li> 	<li>Letöltés: <strong><a href=\\\"https://mtstechnik.com/data/links/bfe422a70f74b029beebae833e4a15dc/26992_84250.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/68ac7375f3f5dc6bbaa6ce70d427f864/26992_84249.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p>A <strong>MTS-Technik Comfort Series sport futóművei</strong> ideális választás azok számára, akik szeretnék kombinálni a sportos megjelenést és az utazási kényelmet. A magasság könnyedén állítható a útviszonyoknak megfelelően, így biztosítva a megfelelő hasmagasságot. Az <strong>MTS-Technik Comfort futóművei</strong> az <strong>Eibach</strong> rugókkal és az MTS-Technik lengéscsillapítókkal tökéletesen működnek együtt.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>Különleges <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>A <strong>Comfort Series</strong> létrehozása során a hangsúlyt nem az extrém ültetésre, hanem a <strong>magas kényelemre</strong> helyezték</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózió ellen (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></p>  <p><em>A weboldal szöveges tartalmának, képeinek felhasználása engedély nélkül tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E36 Compact, 1994.01-2000.08-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e36-compact-1994-01-2000-08-ig-comfort-series-allithato-magassagu-futomu'),
(361, '', '<strong>Bmw E36 Compact V-Maxx állítható magasságú és keménységű futómű</strong>\\n\\n<ul>\\n<li>A Bmw E36 Compact modellhez készült V-Maxx futómű</li>\\n<li>Kizárólag Compact típusú Bmw modellekhez tervezve</li>\\n<li><strong>20 különböző keménységi szint közül választhat</strong></li>\\n<li>Az ültetés mértéke az első tengelynél: 40-80mm</li>\\n<li>Az ültetés mértéke a hátsó tengelynél: 30-60mm</li>\\n<li>A futómű rendelkezik TÜV engedéllyel</li>\\n</ul>', 'V-Maxx Bmw E36 Compact, 1994.04-1998.04-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e36-compact-1994-04-1998-04-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(362, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azok számára, akik nem kívánnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik Sport futóművei optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművekhez tartozó rugók az Eibach gyártmányai</li>\n	<li>Speciális Eibach rugók a maximális sportteljesítmény érdekében</li>\n	<li>A Sport Series létrehozásakor a fő cél a széles ültetési tartomány mellett a kiemelkedő vezetési élmény volt</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E36 Compact, 1994.01-2000.08-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e36-compact-1994-01-2000-08-ig-sport-series-allithato-magassagu-futomu'),
(363, '', '<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik szeretnének egy sportos megjelenést autójuknak, miközben nem szeretnék feláldozni az utazási kényelmet. A futómű magassága könnyedén beállítható a különböző útviszonyoknak megfelelően, így maximalizálva az autó hasmagasságát. Az MTS-Technik Comfort állítható futóművei tökéletes egyensúlyt biztosítanak az Eibach rugók és az MTS-Technik lengéscsillapítók között. </p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművekhez tartozó rugókat az Eibach gyártja.</li>\n	<li>Speciális Eibach rugók a maximális kényelemért.</li>\n	<li>A Comfort Series futóműveknél a hangsúly a magas komfortra került, nem az extrém ültetésre.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevételek esetén is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében.</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén.</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></u></p>\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E36, kivéve Compact és M3, 1990-2000-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e36-kiveve-compact-es-m3-1990-2000-ig-comfort-series-allithato-magassagu-futomu'),
(364, '', '<p><strong>Az MTS-Technik Sport Series általános magasságú sport futómű</strong></p>  <p><u>A megfelelő típusok:</u></p>  <ul> 	<li>A Bmw E36 Sedan, kivéve az M3 modelleket (1991.11-1998.06)</li> 	<li>A Bmw E36 Coupé, kivéve az M3 modelleket (1991.11-1999.04)</li> 	<li>A Bmw E36 Cabrio, kivéve az M3 modelleket (1994.05-1999.05)</li> 	<li>A Bmw E36 Touring (1992.08-1999.09)</li> 	<li><strong>Fontos! Az 1992 előtti modellekbe való beépítéshez toronycsapágy cserére van szükség! Az első lengéscsillapító stabilizátorral rendelkezik!</strong></li> 	<li>Kivéve a Compact és M3 modelleket</li> 	<li>Elülső ültetés: 40-80mm</li> 	<li>Hátsó ültetés: 40-80mm</li> 	<li>Elülső tengely terhelés: 900kg</li> 	<li>Hátsó tengely terhelés: 1220kg</li> </ul>  <p>Az <strong>MTS-Technik Sport Series általános magasságú sport futóművei</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz! Az <strong>MTS-Technik Sport futóművei</strong> tökéletes összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. A maximális vezetési élmény és a széles ültetési tartomány garantált!</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Különleges <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>A <strong>Sport Series</strong> fejlesztése során a fokozott vezetési élmény mellett a széles ültetési tartomány volt a fő szempont</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw E36, kivéve Compact és M3, 1990-2000-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e36-kiveve-compact-es-m3-1990-2000-ig-sport-series-allithato-magassagu-futomu'),
(365, '', '<div>\\n<p>Egy olyan sport futómű, melynek magasságát és keménységét is állíthatod, ideális választás lehet az autódhoz. A Bmw E36 V-Maxx futómű segítségével könnyedén szabályozhatod az autó magasságát és keménységét, így személyre szabhatod az autód futóművét.</p>\\n</div>', 'V-Maxx Bmw E36, kivéve Compact és M3, 1992-2000-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e36-kiveve-compact-es-m3-1992-2000-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(366, '', '<div> <div><strong>Bmw E36 Vogtland állítható magasságú sport futómû</strong></div> <div> </div> <div>Kizárólag M3 és Compact modellekhez nem alkalmas</div> <div>Ültetési tartomány az elülső kerekeknél: 40-80mm</div> <div> </div> <div>Ültetési tartomány a hátsó kerekeknél: 20-50mm</div> <div> </div> <div>Maximális teherbírás (első/hátsó tengely): 890 kg / 1150 kg</div> <div> </div> <div>A termék rendelkezik TÜV engedéllyel!</div> </div>', 'Vogtland Bmw E36, kivéve Compact és M3, 1990.09-1992.06-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e36-kiveve-compact-es-m3-1990-09-1992-06-ig-allithato-magassagu-futomu'),
(367, '', '<div><strong>Bmw E36 Compact Vogtland sport futómű állítható magassággal</strong></div> <div> </div> <div><span>Állítható magasság elöl: 40-80mm</span><br /> <br /> <span>Állítható magasság hátul: 20-50mm</span><br /> <br /> <span>Maximális terhelhetőség (első/hátsó tengely): 850 kg / 1040 kg</span><br /> <br /> <span>A futómű TÜV engedéllyel rendelkezik!</span></div>', 'Vogtland Bmw E36 Compact, 1994.04-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e36-compact-1994-04-tol-allithato-magassagu-futomu'),
(368, '', '<p>A Vogtland állítható magasságú futómű szettet kifejezetten a BMW 3-as sorozathoz tervezték (E36). Az évjárat 1992-től egészen 2000-ig terjedhet, a beültetés mértéke pedig 40-80 mm elöl és 30-60 mm hátul. A készlet a BMW 3 E36 típusokhoz passzol, beleértve a Touringot és az M-Technikát is, kivéve a Compact modelleket. Az elülső tengely maximális terhelése 900 kg, míg a hátsóé 1150 kg lehet. A futómű engedélyezett és minősített, további információkért kattints a <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW200GF11-31_1463-10.pdf\\\" target=\\\"_blank\\\">megfelelő linkre</a>.</p>\n<p>Ez a kiváló minőségű futómű szett nemcsak javítja az autó megjelenését, de garantálja a maximális vezetési élményt is. Az ültetés mértékét saját igényeid szerint állíthatod be a megfelelő értékek között. A speciális készlet magában foglal kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó magas szintű teljesítményéhez.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak. A termék Made in Germany és cikkszáma: 968201.</p>\n<p>Az eredeti termék TÜV engedéllyel rendelkezik!</p>', 'Vogtland Bmw E36, kivéve Compact és M3, 1992.06-2000-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e36-kiveve-compact-es-m3-1992-06-2000-ig-allithato-magassagu-futomu'),
(369, '', '<div><br /><ul><br /><li>A BMW 3-as sorozat Limuzin, Kombi, Kupé és Kabrió változataihoz tervezett futómű összeállítás.</li><br /><li>Az E36 típuskód alá tartozó járművekhez illeszkedő.</li><br /><li>Különböző modellváltozatokkal rendelkező futómű összeállítás.</li><br /><li>A járművek gyártási időszaka: 1990.09 - 1992.06.</li><br /><li>A jármű első tengelyére eső teherbírás: 900 kg, míg a hátsó tengelyre eső: 1150 kg.</li><br /><li>Az eredeti méretű abroncsok és felnik esetén kerektárcsaszélesítő felszerelése szükséges.</li><br /><li>Az 1992.06 utáni modellekhez erősített toronycsapágy javasolt (alkatrészek szükségesek: BMW cikkszám: 31336764947; alátét cikkszám: 31331116983 anyacsavar cikkszám: 31331110196).</li><br /></ul><br /><br /><ul><br /><li>A futómű Németországban gyártott változata, mely rendelkezik német nyelvű TÜV engedéllyel.</li><br /><li>A TÜV engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 20-50 mm között állítható.</li><br /><li>A futómű minden esetben nagyobb intervallumban is beállítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.</li><br /><li>Lehetséges plusz ülésmagasság elöl: +15 mm, hátul: +0 mm.</li><br /></ul><br /><br /><ul><br /><li>A futómű összeállítás gyártója: Ap-Fahrwerke Németország.</li><br /><li>A futóműre vonatkozó garancia időtartama: 2 év.</li><br /></ul><br /><br /><p><strong>Termékkód: GF20-031</strong><br /><br />Az ár egy készletre vonatkozik!</p><br />', 'AP made by KW Bmw E36 összes, kivéve Compact és M3, 1990.09-1992.06-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e36-osszes-kiveve-compact-es-m3-1990-09-1992-06-ig-allithato-magassagu-futomu'),
(370, '', '<div><br /><div style=\\\"box-sizing:border-box; color:#878787; font-family:OpenSans-Regular,sans-serif; font-size:13.3333px; word-wrap:break-word\\\"><br /><ul><br /><li>Az autó márkája BMW 3-as sorozat, ideértve a Limousine, Touring, Coupé és Cabrio modelleket</li><br /><li>A jármű azonosítható E36 kóddal</li><br /><li>Változatok elérhetőek különböző típusokban</li><br /><li>Gyártási időszak: 1992.06 - 1998.02 között</li><br /><li>Tengelyterhelés: elöl 900 kg, hátul 1150 kg</li><br /><li>Egyéb megjegyzés: Az eredeti méretű abroncsok és felnik használatakor szükséges a nyomtávszélesítő felszerelése</li><br /></ul><br /><br /><ul><br /><li>A futómű rendelkezik német nyelvű TÜV engedéllyel</li><br /><li>Az engedélyezett ültetési lehetőségek: Elöl 40-60 mm, hátul 20-50 mm között állítható, a TÜV engedély ezen intervallumokat engedélyezi</li><br /><li>Extra ültetési lehetőségek: Elöl +15 mm, hátul +0 mm</li><br /></ul><br /><br /><ul><br /><li>Gyártó: Ap-Fahrwerke Németország</li><br /><li>Garancia: 2 évig a termékre</li><br /></ul><br /><br /><p><strong>Termék cikkszáma: GF20-011</strong><br /><br />Az ár egy szettre érvényes</p><br />', 'AP made by KW Bmw E36 összes, kivéve Compact és M3, 1992.06-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e36-osszes-kiveve-compact-es-m3-1992-06-tol-allithato-magassagu-futomu'),
(371, '', '<div><strong>Bmw E36 M3 Vogtland sport futómű állítható magassággal</strong></div> <div> </div> <div><span>Elülső ültetési tartomány: 30-60mm</span><br /> <br /> <span>Hátsó ültetési tartomány: 20-45mm</span><br /> <br /> <span>Maximális terhelhetőség (elülső/hátsó tengely): 920 kg / 1130 kg</span><br /> <br /> <span>Ez a termék rendelkezik TÜV engedéllyel!</span></div>', 'Vogtland Bmw E36 M3, 1992.10-1999.04-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e36-m3-1992-10-1999-04-ig-allithato-magassagu-futomu'),
(372, '', '<div> <div> <ul> 	<li>A BMW 3-as széria Compact egy kompakt típusú autó, melynek tipuskódja E36, és 1994 áprilisától gyártják.</li> 	<li>Az autó tengelyterhelése elöl 850 kg, hátul pedig 1040 kg.</li> 	<li>Az eredeti gumiabroncs és felnik mellett nyomtávszélesítő felszerelése szükséges.</li> </ul>  <ul> 	<li>Ez a futómű Németországban gyártott, és rendelkezik Német nyelvű TÜV engedéllyel.</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl 40-60 mm, hátul pedig ugyancsak 40-60 mm között állítható.</li> 	<li>Az ültetés további lehetőségei: elöl +15 mm, hátul +5 mm.</li> </ul>  <ul> 	<li>A futómű gyártója Ap-Fahrwerke Németország, és a termékre 2 év garanciát vállalnak.</li> </ul>  <p><strong>A futómű cikkszáma: GF20-013</strong><br /> Az ár egy szettre vonatkozik.</p> </div>  <div>Az Ap futómű ideális választás a sportosan vezetni szeretők számára, akik szeretnék milliméterre beállítani az autójuk ültetését. A futómű sportos irányíthatóságot és optimális vezetési élményt nyújt a maximális ültetéssel összhangban.</div>  <div>Egy alumínium rugótányér segítségével lehetséges a járműmagasság egyéni beállítása a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes kombinációja biztosít optimális vezetést.</div>  <ul> 	<li>Kiemelkedő minőség megfizethető áron.</li> 	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül.</li> 	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány.</li> 	<li>Kivételes ár-érték arány.</li> 	<li>Német minőség.</li> </ul>  <div>Fontos: Ezen futómű esetében csak a magasság állítható, a keménység nem!</div> </div>', 'AP made by KW Bmw E36 Compact, 1994.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e36-compact-1994-04-tol-allithato-magassagu-futomu'),
(373, '', '<div> <ul> 	<li>A BMW 3-as széria M3 autó modellje</li> 	<li>Tipuskód: E36</li> 	<li>Típus variáció: M3</li> 	<li>Évjárat: 1992.10 - 1999.04</li> 	<li>Tengelyterhelés elöl (kg): 920</li> 	<li>Tengelyterhelés hátul (kg): 1130</li> 	<li>Egyéb kitételek: Az autóhoz ajánlott gumiabroncs és felni kombináció esetén szélesség növelő felszerelése szükséges!<br /> Az ültetés mértéke a gyári értékhez képest változik.</li> </ul>  <ul> 	<li>Ez a futómű Németországban TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke: elöl 30-60 mm, hátul 20-45 mm között állítható<br /> 	(A futómű más beállításokkal is használható, de a TÜV engedély csak a fent említett értékekre vonatkozik.)</li> 	<li>Lehetséges plusz ültetés: elöl +20 mm, hátul +0 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszáma: GF20-012</strong><br /> Az ár egy szettre érvényes!</p> </div>  <div> <div>Az Ap futómű lehetőséget kínál a sportos vezetőknek, hogy egyéni igényeik szerint állítsák be az autó magasságát milliméter pontossággal. A sportos vezetési élményt ötvözi az optimális irányíthatósággal.</div>  <div>Az alumínium rugótányér segítségével a jármű magassága az engedélyezett tartományon belül szabályozható. Az optimális teljesítmény érdekében a sportos vezetési élményt, a kényelmet és a biztonságot tökéletesen egyesíti.</div>  <ul> 	<li>Kiváló minőségű termék megfizethető áron</li> 	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li> 	<li>Magas minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>Kiemelkedő ár-érték arány</li> 	<li>Német minőség</li> </ul>  <div>Fontos! Csak a magasság állítható ezen futómű esetében, a keménység nem módosítható!</div> </div>', 'AP made by KW Bmw E36 M3, 1992.10-1999.04-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e36-m3-1992-10-1999-04-ig-allithato-magassagu-futomu'),
(374, '', '<div><strong>Bmw E38 sport futómű állítható magassággal</strong></div> <div> </div> <div>Az első tengely maximális terhelése: 1135 kg</div> <div>A hátsó tengely maximális terhelése: 1355 kg</div> <div> </div> <div>Az ültetés mértéke az első részen: 20 - 45 mm</div> <div>Az ültetés mértéke a hátsó részen: 20 - 45 mm</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Bmw E38, 1994.10-2001.11-ig, (első tengely terhelés 1135kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-e38-1994-10-2001-11-ig-els-tengely-terheles-1135kg-alatt-allithato-magassagu-futomu'),
(375, '', '<div><strong>Állítható magasságú sport futómű a BMW E38 modellhez</strong></div> <div> </div> <div>Az első tengely terhelése meghaladja a 1135 kg-ot</div> <div>A hátsó tengely terhelése 1355 kg</div> <div> </div> <div>Az ültetés mértéke az első részen 20 - 45 mm között</div> <div>Az ültetés mértéke a hátsó részen is 20 - 45 mm között</div> <div> </div> <div>Ez a termék TÜV engedéllyel rendelkezik!</div>', 'Vogtland Bmw E38, 1994.10-2001.11-ig, (első tengely terhelés 1135kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-bmw-e38-1994-10-2001-11-ig-els-tengely-terheles-1135kg-folott-allithato-magassagu-futomu'),
(376, '', '<div>\\r\\n<ul>\\r\\n	<li>BMW 7-es sorozat</li>\\r\\n	<li>Modellszám: E38</li>\\r\\n	<li>Évjárat: 1994.10 - 2001.11</li>\\r\\n	<li>Elülső tengelyterhelés (kg): 1135</li>\\r\\n	<li>Hátsó tengelyterhelés (kg): 1355</li>\\r\\n	<li>Speciális megjegyzés: Az elektronikus lengéscsillapító-vezérlés nélküli modellekhez készült.<br />\\r\\n	Kivéve az automatikus szintszabályozóval felszerelt vagy utólag beszerelhető modelleket.<br />\\r\\n	A gyári méretű abroncsok és felnik esetén sárvédő szélesítő felszerelése szükséges!</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futómű Németországban engedéllyel rendelkezik!</li>\\r\\n	<li>Az engedélyben meghatározott ültetési tartomány elöl: 30-60 mm, hátsó: 30-60 mm között állítható<br />\\r\\n	(Minden esetben nagyobb tartományban állítható a futómű, de az engedély csak a fenti értékekkel érvényes.)</li>\\r\\n	<li>Extra ültetési lehetőség elöl: +40 mm, hátsó: +40 mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártó: Ap-Fahrwerke Németország</li>\\r\\n	<li>Garancia: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: </strong>11520028</p>\\r\\n</div>\\r\\n', 'AP made by KW Bmw E38, kivéve szintszabályzós és EDC futóművel szerelt, 1994.10-2001.11-ig, (első tengely terhelés 1140kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e38-kiveve-szintszabalyzos-es-edc-futomuvel-szerelt-1994-10-2001-11-ig-els-tengely-terheles-1140kg-alatt-allithato-magassagu-futomu'),
(377, '', '<div>\\r\\n<ul>\\r\\n	<li>BMW 7-es sorozat</li>\\r\\n	<li>Típuskód: E38</li>\\r\\n	<li>Gyártás éve: 1994.10 - 2001.11</li>\\r\\n	<li>Elülső tengelyterhelés (kg): 1255</li>\\r\\n	<li>Hátsó tengelyterhelés (kg): 1355</li>\\r\\n	<li>Speciális jellemzők: Kizárólag az elektronikus lengéscsillapító-vezérlés (EDC) nélküli modellekhez ajánlott.<br />\\r\\n	Kivéve az automata szintszabályzóval rendelkező vagy utólag felszerelhető automata szintszabályzóval ellátott modelleket.<br />\\r\\n	A gyári méretű gumik és felnik kombinációjánál szélesítő tárcsák felszerelése szükséges!</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futómű készlet rendelkezik Németországban kiadott TÜV engedéllyel!</li>\\r\\n	<li>Az engedély által meghatározott magasság elülső részen: 30-60 mm, hátsó részen: 30-60 mm között állítható<br />\\r\\n	(Mindig nagyobb intervallumban is beállítható a futómű, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\\r\\n	<li>További magasságállítási lehetőség elöl: +40 mm, hátsó részen: +40 mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: </strong>11520029</p>\\r\\n</div>\\r\\n', 'AP made by KW Bmw E38, kivéve szintszabályzós és EDC futóművel szerelt, 1994.10-2001.11-ig, (első tengely terhelés 1141-1255kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e38-kiveve-szintszabalyzos-es-edc-futomuvel-szerelt-1994-10-2001-11-ig-els-tengely-terheles-1141-1255kg-ig-allithato-magassagu-futomu'),
(378, '', '<strong>Állítható magasságú sport futómű a BMW E39 Touring modellhez JOM BLUE LINE kivitelben</strong><br />\\r\\nA futómű megfelel a BMW E39 Touring típuskódjának<br />\\r\\nAz évjárat 1995-től 2003-ig terjed<br />\\r\\nAz első tengelyterhelés 1090 kg<br />\\r\\nA futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz<br />\\r\\nKét éves teljeskörű garanciával<br />\\r\\nKiemelkedő minőség, rendkívül vonzó áron</p>\\r\\n', 'Jom Bochum Bmw E39 Touring, kivéve V8 és EDC-vel szerelt, 1995-2003-ig állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e39-touring-kiveve-v8-es-edc-vel-szerelt-1995-2003-ig-allithato-magassagu-futomu'),
(379, '', '<div>\n<p><strong>Jom BlueLine állítható magasságú sportfutómű</strong></p>\n\n<p>A Jom BlueLine sportfutóművek népszerűek a kiváló minőségű német mérnöki munkájuknak köszönhetően. Ez a futómű kifejezetten az E39 típusú autók számára lett tervezve, kivéve a M5, V8 és Touring modelleket.</p>\n\n<p>Az E39 Sedan Jom BlueLine futóművet 1995. decemberétől 2003-ig gyártották, és az elöl 1090 kg, míg hátul 1200 kg tengelyterhelést képes elviselni.</p>\n\n<p>Ez a futómű kiváló minőségű anyagokból készült Németországban, és rendelkezik TÜV minősítéssel, melyet a csomagolásban találsz meg.</p>\n\n<p>A BlueLine futóművek lehetőséget biztosítanak arra, hogy az autó magasságát -4 cm és -8 cm között állítsd, egyszerűen használható állítókulcs segítségével.</p>\n\n<p>A futómű szett tartalmazza a 4 lengéscsillapítót a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulcsot.</p>\n\n<p>Ne hagyd ki ezt a kiváló minőségű, nagyszerű ár-érték arányú Jom BlueLine futóművet!</p>\n</div>\n<div>\n<p><strong>Jom BlueLine állítható magasságú sportfutómű</strong></p>\n</div>\n<div>&nbsp;</div>\n<div>A BlueLine futóművek kiemelkednek a 19.3-as TÜV minősítésükkel, valamint az EPS technológiával porfestett és horganyzott alkatrészekkel.</div>', 'Jom Bochum Bmw E39 Sedan, kivéve M5, V8, Touring, 1995.12-2003-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e39-sedan-kiveve-m5-v8-touring-1995-12-2003-ig-blue-line-allithato-magassagu-futomu'),
(380, '', '<p>Egy új megoldás az autó felfüggesztés területén, az MTS-Technik állítható magasságú sport futóművei ideális választás lehetnek azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóműveiben optimalizált az összhang a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A futóművek rugóit az Eibach gyártja.</li>  \n	<li>A magasság széles határok között, legtöbb esetben 25 és 80 mm között szabadon állítható.</li>  \n	<li>Gáztöltéses lengéscsillapítók biztosítják a magas hatékonyságot extrém igénybevétel esetén is.</li>  \n	<li>Két rétegű bevonat biztosít hosszú távú korrózióvédelmet (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>  \n	<li>A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással.</li>  \n	<li>A készlet plug & play, nincs szükség módosításokra az autó felfüggesztésén.</li>  \n</ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Bmw E39 Touring, hátul légrugós, 1995.11-2003.06-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e39-touring-hatul-legrugos-1995-11-2003-06-ig-street-series-allithato-magassagu-futomu'),
(381, '', '<strong>Átfordítható magasságú sport futómű a Bmw E39 Touring járművekhez</strong></p>  <ul> 	<li>Bmw E39 Touring modellek: 520i / 523i / 525i / 528i / 530i / 540i / 520d /525d / 525tds / 530d</li> 	<li>Elülső tengely terhelése: 1090kg</li> 	<li>Elülső ülésmagasság beállítása: 20-70mm</li> </ul>  <p>Az állítható magasságú sport futóművek a MTS-Technik Sport sorozatból ideális választást nyújtanak azoknak, akik nem akarnak kompromisszumot kötni. Az MTS-Technik Sport futóművei fokozatmentesen beállítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Ezek a futóművek optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ülésmagasság-tartományt.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók a sportos teljesítmény érdekében</li> 	<li>A Sport sorozat létrehozásakor a cél a szélesebb ülésmagasság-tartomány mellett a fokozott vezetési élmény elérése volt</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></p> ', 'MTS-Technik by Nord Performance Bmw E39 Touring, hátul légrugós, 1995.11-2003.06-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e39-touring-hatul-legrugos-1995-11-2003-06-ig-sport-series-allithato-magassagu-futomu'),
(382, '', '<div>\\r\\n<p><strong>A Bmw E39 Sedan FK-Automotive állítható magasságú sport futómű jellemzői</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Típuskód: E39</li>\\r\\n	<li>Évjárat: 1995.12 - 2003</li>\\r\\n	<li>Kivéve: M5, V8, Touring</li>\\r\\n	<li>Tengelyterhelés elöl: 1090 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 1290 kg</li>\\r\\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\\r\\n	<li>A futómű megfelel a német nyelvű TÜV engedély követelményeinek, melyet a csomag tartalmaz</li>\\r\\n	<li>1 ÉV TELJES GARANCIÁVAL!!!</li>\\r\\n</ul>\\r\\n\\r\\n<p>Kiemelkedő minőség, páratlan ár-érték arány!!!</p>\\r\\n\\r\\n<p>A csomag tartalma: 4 db lengéscsillapító, hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</p>\\r\\n</div>\\r\\n\\r\\n<div> </div>\\r\\n', 'FK-Automotive Bmw E39 Sedan, kivéve M5, V8, Touring, 1995.12-2003-ig, Blue Line állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e39-sedan-kiveve-m5-v8-touring-1995-12-2003-ig-blue-line-allithato-magassagu-futomu'),
(383, '', '<strong>BMW E39 Touring MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik által kínált sport futóművek kiváló választást nyújtanak azoknak, akik számára fontos a minőség és az ár. Az állítható magasságú futóművek lehetővé teszik az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben az optimális egyensúlyt a rugók és a lengéscsillapítók között biztosítják.</p>  <p><u>A futóművek a következő típusokhoz passzolnak:</u></p>  <ul> 	<li>Bmw E39 Touring, 520i / 523i / 525i / 528i / 530i / 540i / 520d / 525d / 525tds / 530d</li> 	<li><strong>Fontos! Hátul légrugós típusokhoz! A csomag tartalmazza az ültetéshez szükséges hátsó állítható szintező pálcikákat.</strong></li> 	<li>Elülső ültetés mértéke: 20-70mm</li> 	<li>Hátsó ültetés mértéke: 10-40mm (A szintező pálcikák segítségével)</li> 	<li>Elülső tengely terhelés: 1095kg</li> 	<li>Hátsó tengely terhelés: 1410kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/4cf6a8d801210588e6b52762a494acb9/40730_108904.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/0bd0dae3ab7b61a435a03fca9ea36705/40730_108903.pdf\\\"><span>Szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém terhelésnél is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes együttműködése</li> 	<li>A csomag plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Bmw E39 Touring, hátul légrugós, 1996.09-2004.06-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e39-touring-hatul-legrugos-1996-09-2004-06-ig-street-series-allithato-magassagu-futomu'),
(384, '', '<div>\n<p>Egyedi és testreszabható futómű megoldások elérhetőek a BMW E39 Sedan modellhez. Ezek a futóművek lehetővé teszik a magasság könnyű beállítását, így maximális vezetési élményt nyújtanak.</p>\n</div>', 'V-Maxx Bmw E39 Sedan, kivéve M5, V8, Touring, 1995.12-2003-ig állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e39-sedan-kiveve-m5-v8-touring-1995-12-2003-ig-allithato-magassagu-futomu'),
(385, '', '<p><strong>Bmw E39 Sedan MTS-Technik Sport Series állítható magasságú sport futómû</strong></p>  <ul> 	<li>Bmw E39 Sedan, 520i / 523i / 525i / 528i / 530i / 535i / 540i / 520d / 525td / 525d / 525tds / 530d</li> 	<li>Elsõ tengely terhelés: 1090kg</li> 	<li>Hátsó tengely terhelés: 1200kg</li> 	<li>Ültetés mértéke elõl: 30-70mm</li> 	<li>Ültetés mértéke hátul: 30-120mm</li> 	<li>Letölthetõ dokumentum:<strong> <a href=\\\"https://mtstechnik.com/data/links/d9f7abd5710155a6ef4513871d8d2567/36189_53632.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/c1bfe1cea434e3917465ed8d52ebb397/27005_53625.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futómû</strong> egy kiváló választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság könnyedén beállítható az útviszonyoknak megfelelően, így maximális vezetési élményt nyújt. Az <strong>MTS-Technik Sport állítható futóművei</strong> tökéletes összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva a széles ültetési tartományt.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>A <strong>Sport Series</strong> célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelemért</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><u><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw E39 Sedan, kivéve M5, Touring, 1995.12-2003-ig, (első tengely terhelés 1090kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e39-sedan-kiveve-m5-touring-1995-12-2003-ig-els-tengely-terheles-1090kg-alatt-sport-series-allithato-magassagu-futomu'),
(386, '', '<strong>Egyedi magasságú sport futómű a BMW E39 Touring számára</strong></p>  <p>A MTS-Technik egyedi magasságú sport futóművei kiváló választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az kedvező ár. Az egyedi magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóművei ideális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Ez a futómű tökéletes választás az alábbi típusokhoz:</u></p>  <ul> 	<li>Bmw E39 Touring, 520i / 523i / 525i / 528i / 530i / 540i / 520d / 525d / 525tds / 530d</li> 	<li><strong>Fontos tudni: Ez a futómű nem alkalmas légrugós hátsó felfüggesztéshez!</strong></li> 	<li>Elülső ültetés: 20-70mm</li> 	<li>Hátsó ültetés: 10-40mm</li> 	<li>Elülső tengely terhelése: 1095kg</li> 	<li>Hátsó tengely terhelése: 1410kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/8823585fe0044824db62ddcb48c1c17f/40731_108913.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/133fc56effbc153fca73cda38c2ae0fb/40731_108912.pdf\\\"><span>Szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termék jellemzői:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25-80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> 	<li>Egyedi összeállítás, plug & play rendszer, nem igényel módosítást a felfüggesztésben</li> </ul>  <p><u><strong>Termék jellemzése:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p> ', 'MTS-Technik by Nord Performance Bmw E39 Touring, kivéve hátul légrugós, 1996.09-2004.06-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e39-touring-kiveve-hatul-legrugos-1996-09-2004-06-ig-street-series-allithato-magassagu-futomu'),
(387, '', '<p>Az MTS-Technik Sport sorozatú állítható magasságú sport futóművei ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport futóművei tökéletes összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>A következő típusokhoz alkalmas:</u></p>\n<ul>\n	<li>Bmw E39 Touring, 520i / 523i / 525i / 528i / 530i / 540i / 520d / 525d / 525tds / 530d</li>\n	<li><strong>Figyelem! Kivéve hátul légrugós típusokhoz!</strong></li>\n	<li>Ültetés mértéke elöl: 20-70mm</li>\n	<li>Ültetés mértéke hátul: 10-40mm</li>\n	<li>Első tengely terhelés: 1095kg</li>\n	<li>Hátsó tengely terhelés: 1410kg</li>\n	<li>Letölthető dokumentumok: <strong><a href=\"https://mtstechnik.com/data/links/8823585fe0044824db62ddcb48c1c17f/40731_108913.pdf\"><span>TÜV engedély</span></a></strong>, <strong><a href=\"https://mtstechnik.com/data/links/133fc56effbc153fca73cda38c2ae0fb/40731_108912.pdf\"><span>szerelési útmutató</span></a></strong></li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>a Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E39 Touring, kivéve hátul légrugós, 1996.09-2004.06-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e39-touring-kiveve-hatul-legrugos-1996-09-2004-06-ig-sport-series-allithato-magassagu-futomu'),
(388, '', '<div><span>A sportosan ambiciózus vezetők számára az Ap futómű lehetőséget kínál arra, hogy a kívánt ültetést milliméter pontossággal beállítsák. Az optimális vezetési élmény és sportos irányíthatóság ötvözésével maximalizálhatjuk az ülést.</span></div> <div><span>A járműmagasság egyénileg beállítható az alumínium rugótányér segítségével a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtjük meg, biztosítva a kiváló teljesítményt.</span></div> <ul>     <li><span>Elérhető kiváló minőségű termék megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Különleges ár/érték arány</span></li>     <li><span>Német minőségű termék</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</span></div>', 'AP made by KW Bmw E39 Touring, csak szintszabályzós és levegős futóművel szerelt, 1997.01-től, (első tengely terhelés 1021-1095kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e39-touring-csak-szintszabalyzos-es-levegs-futomuvel-szerelt-1997-01-tol-els-tengely-terheles-1021-1095kg-ig-allithato-magassagu-futomu'),
(389, '', '<div> <ul> 	<li>A BMW 5-ös széria Touring modellekhez</li> 	<li>Tipuskód: E39</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1997.01-tõl</li> 	<li>Tengelyterhelés elöl (kg): 1095</li> 	<li>Tengelyterhelés hátul (kg): 1410</li> 	<li>Egyéb információk: Azokhoz a járművekhez, amelyek nem rendelkeznek automata szintszabályzóval vagy nem építhető be automata szintszabályzóval.</li> </ul>  <ul> 	<li>Ez a futóműkészlet rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben rögzített ültetési lehetőségek: elöl 35-65 mm, hátul 30-60 mm között állítható</li> 	<li>Extra ültetési opciók: elöl +50 mm, hátul +0 mm</li> </ul> </div>  <div>Az Ap futómű célja a sportosan ambiciózus vezetők igényeinek kielégítése, lehetővé téve a milliméteres pontosságú ültetés beállítását. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínálva.</div>  <div>A jármű magasságát alumínium rugótányér segítségével lehet egyénileg beállítani a TÜV által engedélyezett tartományon belül. Az optimális felépítés biztosítja a sportosságot, kényelmet és biztonságot.</div>  <ul> 	<li>Kiemelkedő minőség megfizethető áron</li> 	<li>Egyedi magasság beállítási lehetőség a TÜV által engedélyezett tartományban</li> 	<li>Magas minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>Kiváló ár-érték arány</li> 	<li>Német minőség</li> </ul>  <div>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem!</div> ', 'AP made by KW Bmw E39 Touring, kivéve szintszabályzós és levegős futóművel szerelt, 1997.01-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e39-touring-kiveve-szintszabalyzos-es-levegs-futomuvel-szerelt-1997-01-tol-allithato-magassagu-futomu'),
(390, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák a kívánt ültetést. Az optimális vezetési magatartás és a sportos irányíthatóság kombinációját kínáljuk a maximális ültetéssel összekötve.</span></div> <div><span>A járműmagasság egyénileg állítható alumínium rugótányér segítségével a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság párhuzamos összehangolása optimális felépítést biztosít.</span></div> <ul>     <li><span>Kiváló minőség megfizethető áron</span></li>     <li><span>Egyéni magasság beállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár/érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Fontos tudnivaló! Csak a magasság állítható ezen futómű esetében, a keménység nem!</span></div>', 'AP made by KW Bmw E39 Sedan, kivéve M5, szintszabályzós, levegős futóművel szerelt, 1995.12-től, (első tengely terhelés 1021-1090kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e39-sedan-kiveve-m5-szintszabalyzos-levegs-futomuvel-szerelt-1995-12-tol-els-tengely-terheles-1021-1090kg-ig-allithato-magassagu-futomu'),
(391, '', '<div><strong>Vogtland állítható magasságú sport futómű Bmw E39 Touringhoz</strong></div> <div> </div> <div>Csak olyan típusokhoz ajánlott, amelyek légrugós futóművel vannak felszerelve!</div> <div>Az első tengely megterhelése: kevesebb, mint 1095 kg</div> <div> </div> <div>Az ültetés mértéke az első tengelyen: 35 - 65 mm</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Bmw E39 Touring, csak légrugós típusokhoz, 1997.01-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e39-touring-csak-legrugos-tipusokhoz-1997-01-tol-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(392, '', '<div><strong>Vogtland állítható magasságú sport futómű a BMW E39 Touringhoz</strong></div> <div> </div> <div>Nem alkalmas légrugós futóművel szerelt modellekhez!</div> <div>Első tengely terhelés: legfeljebb 1095 kg</div> <div>Hátsó tengely terhelés: legfeljebb 1410 kg</div> <div> </div> <div>Elülső ültetés mértéke: 35 - 65 mm</div> <div><span>Hátsó ültetés mértéke: 30 - 60 mm</span></div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Bmw E39 Touring, kivéve szintállítós, 1997.01-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e39-touring-kiveve-szintallitos-1997-01-tol-allithato-magassagu-futomu'),
(393, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák a kívánt ültetést. Az optimális vezetési magatartás és a sportos irányíthatóság kombinációját kínáljuk, maximális ültetéssel összekötve.</span></div> <div><span>A járműmagasságot egy alumínium rugótányér segítségével egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. Az optimális felépítés biztosítja a sportosságot, kényelmet és biztonságot egyaránt.</span></div> <ul>     <li><span>Kiváló minőség elérhető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár/érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem!</span></div>', 'AP made by KW Bmw E39 M5 Sedan, 1999.01-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e39-m5-sedan-1999-01-tol-allithato-magassagu-futomu'),
(394, '', '<div> <p><strong>Vogtland</strong> által állítható magasságú futómű szett a BMW 5-ÖS (E39) modellekhez.</p>  <ul> 	<li><strong>Évjárat</strong>: 1995-2003</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 65 / 30 - 60 mm</li> 	<li><strong>Típus</strong>: BMW 5 E39, Typ 5/D, Lim. / Sedan, kivéve szintező, kivéve M5, V8, Touring</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1090 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1200 kg</li> 	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW200GF07_1462-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW200GF07_1462-10.pdf</a></li> </ul>  <p>A Vogtland futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. A felhasználó szabadon állíthatja az ültetés mértékét a személyes igényei szerint. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel ellátottak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint egy évszázados tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968703</p> </div>', 'Vogtland Bmw E39 Sedan, kivéve M5, V8, Touring, 1995.12-2003-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e39-sedan-kiveve-m5-v8-touring-1995-12-2003-ig-allithato-magassagu-futomu'),
(395, '', '<div><span>A Ap futómű lehetőséget nyújt a sportosan ambiciózus vezetők számára, hogy milliméterre precízen beállítsák a kívánt ültetést. Az optimális vezetési magatartás és sportos irányíthatóság kombinációját kínáljuk, maximális ültetéssel összhangban.</span></div> <div><span>Alumínium rugótányér segítségével a járműmagasság egyénileg beállítható a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes összehangolása optimális felépítést eredményez.</span></div> <ul> <li><span>Kiváló minőség, megfizethető áron.</span></li> <li><span>Egyéni magasság beállítás a TÜV által engedélyezett tartományban.</span></li> <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány.</span></li> <li><span>Egyedülálló ár/érték arány.</span></li> <li><span>Német minőség.</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem!</span></div>', 'AP made by KW Bmw E39 Touring, csak szintszabályzós és levegős futóművel szerelt, 1997.01-től, (első tengely terhelés 1020kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e39-touring-csak-szintszabalyzos-es-levegs-futomuvel-szerelt-1997-01-tol-els-tengely-terheles-1020kg-alatt-allithato-magassagu-futomu'),
(396, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal beállítsák az általuk kívánt üléspozíciót. A sportos irányíthatóság és optimális vezetési magatartás összekapcsolása a maximális ülésmagassággal.</span></div> <div><span>A jármű magasságát egy alumínium rugótányér segítségével egyénileg beállíthatja a TÜV által engedélyezett tartományban, így biztosítva a sportosságot, kényelmet és biztonságot egy optimális konfigurációban.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Egyéni magasság állítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Különleges ár-érték arány</span></li>     <li><span>Német minőségű</span></li> </ul> <div><span>Fontos! A futómű magassága állítható, de a keménység nem!</span></div>', 'AP made by KW Bmw E39 Sedan, kivéve M5, szintszabályzós, levegős futóművel szerelt, 1995.12-től, (első tengely terhelés 1020kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e39-sedan-kiveve-m5-szintszabalyzos-levegs-futomuvel-szerelt-1995-12-tol-els-tengely-terheles-1020kg-alatt-allithato-magassagu-futomu'),
(397, '', '<div><strong>Bmw E39 M5 Vogtland állítható magasságú sport futómű</strong></div> <div> </div> <div><span>Elöl a magasság 35 - 65 mm között állítható</span><br /> <br /> <span>Hátul a magasság 20 - 50 mm között állítható</span><br /> <br /> <span>Ez a futómű természetesen rendelkezik TÜV engedéllyel!</span></div>', 'Vogtland Bmw E39 M5 Sedan, 1999.01-2003.12-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e39-m5-sedan-1999-01-2003-12-ig-allithato-magassagu-futomu'),
(398, '', '<div><strong>Bilstein B14 sport futómű BMW E39-hez, állítható magassággal</strong></div> <div> </div> <div>Ez a futómű alkalmas minden E39 modellre, kivéve az M5 és V8 típusokat.</div> <div>Az ültetés mértéke az első tengelynél 35 - 50 mm, míg a hátsó tengelynél 20 - 50 mm.</div> <div> </div> <div>Az első tengely terhelése 1105 kg, míg a hátsó tengely terhelése 1225 kg.</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel, így biztonságosan használható!</div>', 'Bilstein Bmw E39, kivéve M5, V8, Touring, 1998.08-2003.06-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-bmw-e39-kiveve-m5-v8-touring-1998-08-2003-06-ig-bilstein-b14-allithato-magassagu-futomu'),
(399, '', '<p><strong>Bmw E39 Eibach Pro Street S állítható futómû</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Bmw E39 Sedan, 520i, 523i, 525i, 528i, 530i, 520d, 525d, 525td, 525tds</li>\\r\\n	<li>Elsõ tengely terhelés: 1020kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1200kg alatt</li>\\r\\n	<li>Ültetés mértéke elõl: 35-65mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-65mm</li>\\r\\n</ul>\\r\\n\\r\\n<p>Tulajdonságok:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Minden Eibach Pro Street S gewinde rendelkezik TÜV minõsítéssel</li>\\r\\n	<li>A Pro Street S egy sportos és egyszerre komfortos állítható futómû</li>\\r\\n	<li>DIN ISO/TS 16949 szabvány szerinti gyártás</li>\\r\\n	<li>Az ibach Motorsportban szerzett tapasztalatait (Forma 1, Rally, túrabajnokság) ültette át a csúcs minõségû utcai futómûveibe</li>\\r\\n	<li>Fokozatmentes magasságállítás a speciális polyamid rugótányér segítségével</li>\\r\\n	<li>Rozsdamentes kivitel</li>\\r\\n	<li>24 hónap garancia</li>\\r\\n</ul>\\r\\n', 'Eibach Bmw E39 Sedan, 1995.11-2003.06-ig, (első tengely terhelés 1020kg alatt), Pro Street S állítható magasságú futómű', '', '', '', 'eibach-bmw-e39-sedan-1995-11-2003-06-ig-els-tengely-terheles-1020kg-alatt-pro-street-s-allithato-magassagu-futomu'),
(400, '', '<strong>Bmw E39 Eibach Pro Street S állítható futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A Bmw E39 Sedan modellekhez kínált Eibach Pro Street S állítható futómű</li>\\r\\n	<li>Első és hátsó tengely terhelési korlátok</li>\\r\\n	<li>Lehetséges ültetés mértéke elöl és hátul</li>\\r\\n</ul>\\r\\n\\r\\n<p>Fontos jellemzők:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>TÜV minősítéssel rendelkező Eibach Pro Street S gewinde</li>\\r\\n	<li>Sportos és kényelmes futómű egyben</li>\\r\\n	<li>DIN ISO/TS 16949 szabvány szerint gyártva</li>\\r\\n	<li>Motorsport tapasztalatok átültetve az utcai futóművekbe</li>\\r\\n	<li>Fokozatmentesen állítható magasság polyamid rugótányér segítségével</li>\\r\\n	<li>Rozsdamentes anyagból készült</li>\\r\\n	<li>24 hónapos garancia a termékre</li>\\r\\n</ul>\\r\\n', 'Eibach Bmw E39 Sedan, 1995.11-2003.06-ig, (első tengely terhelés 1021-1090kg), Pro Street S állítható magasságú futómű', '', '', '', 'eibach-bmw-e39-sedan-1995-11-2003-06-ig-els-tengely-terheles-1021-1090kg-pro-street-s-allithato-magassagu-futomu'),
(401, '', '<p>Ez a JOM BlueLine Állítható magasságú futómű ideális választás a következő autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>BMW E46</li>\\r\\n	<li>Kivéve: iX és M3</li>\\r\\n	<li><strong>Fontos! Nem ajánlott 330D típusokhoz!</strong></li>\\r\\n	<li>Évjárat: 1998 &ndash; 2005</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1075</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1250</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-75mm, hátul: 30-60mm között állítható<br />\\r\\n	(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n	<li><strong>A futómű beszereléséhez rövidített stabilizátor szett használata ajánlott! A szett NEM tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártó: JOM, Németország</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: 741015</strong></p>\\r\\n\\r\\n<p><br />\\r\\nAz ár 1 szettre vonatkozik!</p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p>A JOM Blueline Állítható magasságú futóműszett kiváló minőségű autóspecifikus alkatrészekből áll össze.</p>\\r\\n\\r\\n<p>A magasság beállítása egyéni igények szerint módosítható az előzőleg említett paraméterek között.</p>\\r\\n\\r\\n<p>A rugó keménysége és a csillapítás mértéke az egész beállítási tartományban azonos marad.</p>\\r\\n\\r\\n<p>Kiemelkedően nagy kanyarstabilitást biztosít, mivel rendkívül ellenáll a keresztirányú erőknek.</p>\\r\\n', 'Jom Bochum Bmw E46, kivéve iX és M3, 1998-2007-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e46-kiveve-ix-es-m3-1998-2007-ig-blue-line-allithato-magassagu-futomu'),
(402, '', 'Ez a futómű megfelel az iX és M3 típusú autóknak, kivéve a BMW E46 típust.<br />Nem ajánlott a 330D modellekhez.<br />Az alkatrész tartalmazza mind az első, mind a hátsó toronycsapágyakat, és használható a 1998 és 2005 közötti években gyártott autókhoz.<br />A futómű terhelése az első részen 1075 kg, a hátsó részen pedig 1250 kg lehet.<br />Rendelkezik német nyelvű TÜV engedéllyel.<br />Az engedélyezett ültetés mértéke az első részen 40-75 mm között, míg a hátsó részen 30-60 mm között állítható.<br />Fontos tudni, hogy bár a futómű nagyobb intervallumban is állítható, a TÜV engedély csak a korábban említett beállításokkal érvényes.<br />A futóműszett Németországban, pontosan JOM-ban készült.<br />A cikkszám: 741015S.<br />Az ár egy szettre vonatkozik.<br />A JOM BlueLine Állítható magasságú futóműszett kiváló minőségű autó-specifikus alkatrészekből áll.<br />A magasság beállítása testreszabható az egyéni igényeknek megfelelően a fent említett paraméterek között.<br />A rugó keménysége és a csillapítás mértéke az egész beállítási tartományban állandó.<br />Ez a futómű nagy kanyarstabilitást biztosít, mivel rendkívül ellenáll a keresztirányú erőknek.', 'Jom Bochum Bmw E46, kivéve iX és M3, 1998-2007-ig, Blue Line, toronycsapágyakkal állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e46-kiveve-ix-es-m3-1998-2007-ig-blue-line-toronycsapagyakkal-allithato-magassagu-futomu'),
(403, '', '<p><strong>Bmw E46 FK-Automotive AK Street Állítható Magasságú Futómû</strong></p>\\r\\n\\r\\n<p>Autótípus: Bmw E46 Coupé, kivéve M3, iX</p>\\r\\n\\r\\n<p>Évjárat: 1998.04 - 2006</p>\\r\\n\\r\\n<p>Az ültetés mértéke: 4 - 10 cm között állítható</p>\\r\\n\\r\\n<p>Az ár tartalmaz 1pár rövidített stabilizátor rudat!</p>\\r\\n\\r\\n<p>A termékre 1 év garancia vonatkozik!</p>\\r\\n\\r\\n<p>Elöl és hátul is változtatható a magassága</p>\\r\\n\\r\\n<p>A FK-Automotive AK Street állítható futómű nagy skálán állítható magassággal rendelkezik</p>\\r\\n\\r\\n<p>Sportos, szilárd és tartós kialakítású</p>\\r\\n\\r\\n<p>A futómű TÜV engedéllyel rendelkezik</p>\\r\\n\\r\\n<p>Anyaga: Acél</p>\\r\\n', 'FK-Automotive Bmw E46 Coupé, kivéve iX és M3, 1998-2006-ig, rövidített stabilizátor rúddal állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e46-coupe-kiveve-ix-es-m3-1998-2006-ig-roviditett-stabilizator-ruddal-allithato-magassagu-futomu'),
(404, '', '<strong>FK-Automotive AK Street Állítható Magasságú Futómű a BMW E46 számára</strong></p>\\r\\n\\r\\n<p>A futómű kompatibilis a BMW E46 Cabrio modellekkel (kivéve M3, iX) az évek 2000 és 2007 között.</p>\\r\\n\\r\\n<p>Az ültetés mértéke könnyedén 4 és 10 cm között állítható, és tartalmaz egy pár rövidített stabilizátor rudat.</p>\\r\\n\\r\\n<p>A termékhez 1 év garancia jár, és lehetőség van elöl és hátul is állítani a magasságát.</p>\\r\\n\\r\\n<p>A FK-Automotive AK Street futómű nagy intervallumban állítható, sportos, feszes és rendkívül strapabíró. Az anyaga acél, és rendelkezik TÜV engedéllyel.</p>\\r\\n', 'FK-Automotive Bmw E46 Cabrio, kivéve iX és M3, 2000-2007-ig, rövidített stabilizátor rúddal állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e46-cabrio-kiveve-ix-es-m3-2000-2007-ig-roviditett-stabilizator-ruddal-allithato-magassagu-futomu'),
(405, '', '<p><strong>FK-Automotive AK Street állítható futómű a Bmw E46 számára</strong></p>\n<p>Autótípus: Bmw E46 sedan, touring, compact modellekhez, kivéve M3 és iX</p>\n<p>Évjárat: 1998.04 - 2006</p>\n<p>A futómű ültetési magassága 4 - 10 cm között állítható</p>\n<p>Az ár tartalmazza a 1 pár rövidített stabilizátor rudat</p>\n<p>1 év garancia a termékre</p>\n<p>A futómű elöl és hátul is állítható magassággal rendelkezik</p>\n<p>A FK-Automotive AK Street futómű nagy intervallumban szabályozható magassággal</p>\n<p>Sportos, feszes és tartós kivitel</p>\n<p>TÜV engedéllyel ellátott</p>\n<p>Anyaga: Acél</p>', 'FK-Automotive Bmw E46 Sedan, Touring, Compact, kivéve iX és M3, 1998-2006-ig, rövidített stabilizátor rúddal állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e46-sedan-touring-compact-kiveve-ix-es-m3-1998-2006-ig-roviditett-stabilizator-ruddal-allithato-magassagu-futomu'),
(406, '', '<div>\\n<p>Egy olyan sport futómű, amely lehetővé teszi az állítható magasságot a BMW E46 típusú autó számára.</p>\\n</div>', 'V-Maxx Bmw E46, kivéve iX és M3, 1998-2007-ig állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e46-kiveve-ix-es-m3-1998-2007-ig-allithato-magassagu-futomu'),
(407, '', '<p><strong>FK-Automotive állítható magasságú és keménységű futómű a BMW E46 Cabrio modellhez</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: E46 Cabrio</li>\\r\\n	<li>Évjárat: 2000-2007</li>\\r\\n	<li>Kivéve: M3</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű ültetésének mértéke rugalmasan változtatható 40 - 80 mm között</li>\\r\\n	<li>Rövidített stabilizátor rúd használata javasolt, ami a szett részét képezi</li>\\r\\n	<li>Első tengely terhelése: 920kg</li>\\r\\n	<li>Hátsó tengely terhelése: 1150kg</li>\\r\\n	<li>A futómű magassága mind elöl, mind hátul állítható</li>\\r\\n	<li><strong>A futómű keménysége is változtatható!</strong></li>\\r\\n	<li>Széles skálán módosítható a futómű magassága</li>\\r\\n	<li>Sportos, stabil és strapabíró</li>\\r\\n	<li>Német nyelvű TÜV engedéllyel rendelkezik</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E46 Cabrio, kivéve iX és M3, 2000-2007-ig, rövidített stabilizátor rúddal, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e46-cabrio-kiveve-ix-es-m3-2000-2007-ig-roviditett-stabilizator-ruddal-allithato-kemenysegu-allithato-magassagu-futomu'),
(408, '', '<p><strong>Bmw E46 FK-Automotive Állítható Magasságú és Keménységű Futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: E46 Coupé</li>\\r\\n	<li>Évjárat: 1998-2006</li>\\r\\n	<li>Kivéve: M3</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű ültetése 40 - 80 mm között állítható</li>\\r\\n	<li>A rövidített stabilizátor rúd használata javasolt és a szett tartalmazza</li>\\r\\n	<li>Az első tengely terhelése: 920kg</li>\\r\\n	<li>A hátsó tengely terhelése: 1150kg</li>\\r\\n	<li>Lehetőség van az első és hátsó magasságának állítására</li>\\r\\n	<li><strong>Állítható keménységű kivitelben kapható</strong></li>\\r\\n	<li>Széles intervallumban változtatható a magassága</li>\\r\\n	<li>Kiválóan sportos, feszes és strapabíró</li>\\r\\n	<li>Rendelkezik német nyelvű TÜV engedéllyel</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E46 Coupé, kivéve iX és M3, 1998-2006-ig, rövidített stabilizátor rúddal, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e46-coupe-kiveve-ix-es-m3-1998-2006-ig-roviditett-stabilizator-ruddal-allithato-kemenysegu-allithato-magassagu-futomu'),
(409, '', '<p><strong>FK-Automotive Állítható Magasságú és Keménységű Futómű a BMW E46-hoz</strong></p>\n<ul>\n	<li>Autótípus: E46 Sedan és Touring</li>\n	<li>Évjárat: 1998-2006</li>\n	<li>Kivéve: M3</li>\n</ul>\n<ul>\n	<li>Az ültetés mértéke körülbelül: 40 - 80 mm között állítható</li>\n	<li>Rövidített stabilizátor rúd ajánlott</li>\n	<li>Első tengely terhelés: 920kg</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Állítható magasság elöl és hátul</li>\n	<li><strong>Állítható keménységű kivitel!</strong></li>\n	<li>Nagy intervallumban változtatható a magassága</li>\n	<li>Sportos, feszes és strapabíró kialakítású</li>\n	<li>Német nyelvű TÜV engedéllyel rendelkezik</li>\n	<li>Anyaga: Acél</li>\n</ul>', 'FK-Automotive Bmw E46 Sedan és Touring, kivéve iX és M3, 1998-2006-ig, rövidített stabilizátor rúddal, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e46-sedan-es-touring-kiveve-ix-es-m3-1998-2006-ig-roviditett-stabilizator-ruddal-allithato-kemenysegu-allithato-magassagu-futomu'),
(410, '', '<p>Az MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választás azok számára, akiknek fontos a sportos megjelenés mellett az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik Comfort futóművei optimális egyensúlyt teremtenek az Eibach rugók és MTS-Technik lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz illeszthető:</u></p>\n<ul>\n	<li>BMW E46 Sedan, 316 / 318 / 320 / 323 / 325 / 328 / 330 / 318d / 320d / 330d</li>\n	<li>BMW E46 Coupé, 316 / 318 / 320 / 323 / 325 / 328 / 330 / 318d / 320d / 330d</li>\n	<li>BMW E46 Touring, 320i / 325i / 328i / 330i / 318d / 320d</li>\n	<li>BMW E46 Cabrio, 318Ci / 320Ci / 323Ci / 325Ci / 330Ci / 320Cd / 330Cd</li>\n	<li>BMW E46 Compact, 316 / 318 / 320 / 323 / 325 / 328 / 330 / 320d / 330d</li>\n	<li>Az ár tartalmazza a rövidített stabilizátor rudakat!</li>\n	<li>Ültetés mértéke elöl: 20-70mm</li>\n	<li>Ültetés mértéke hátul: 20-65mm</li>\n	<li>Rugó erősség (első, fő rugó): 60 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 45 - 82 - 110 N/mm</li>\n	<li>Első tengely terhelés: 1030kg</li>\n	<li>Hátsó tengely terhelés: 1215kg</li>\n	<li>Kivéve x-Drive modellek</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort sorozat kialakításakor a hangsúly nem az extrém ültetésen, hanem a magas kényelemben van</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><u><strong>Termék jellemzők:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E46, kivéve xDrive és M3, 1998-2007-ig, rövidített stabilizátor rúddal, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e46-kiveve-xdrive-es-m3-1998-2007-ig-roviditett-stabilizator-ruddal-comfort-series-allithato-magassagu-futomu'),
(411, '', '<p>Az MTS-Technik Sport sorozatú állítható magasságú sport futóművei ideális választás azok számára, akik nem szeretnének kompromisszumot kötni. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén beállítsa az autó hasmagasságát az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, így maximális vezetési élményt és széles ültetési tartományt biztosítanak.</p>\n\n<p><u>A következő típusokhoz passzol:</u></p>\n<ul>\n	<li>BMW E46 Sedan, 316 / 318 / 320 / 323 / 325 / 328 / 330 / 318d / 320d / 330d</li>\n	<li>BMW E46 Coupé, 316 / 318 / 320 / 323 / 325 / 328 / 330 / 318d / 320d / 330d</li>\n	<li>BMW E46 Touring, 320i / 325i / 328i / 330i / 318d / 320d</li>\n	<li>BMW E46 Cabrio, 318Ci / 320Ci / 323Ci / 325Ci / 330Ci / 320Cd / 330Cd</li>\n	<li>BMW E46 Compact, 316 / 318 / 320 / 323 / 325 / 328 / 330 / 320d / 330d</li>\n	<li>Az ár tartalmazza a rövidített stabilizátor rudakat!</li>\n	<li>Ültetés mértéke elöl: 20-70mm</li>\n	<li>Ültetés mértéke hátul: 28-80mm</li>\n	<li>Rugó erősség (első, fő rugó): 90 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 300 N/mm</li>\n	<li>Rugó erősség (hátsó, segéd rugó): 90 N/mm</li>\n	<li>Elülső tengely terhelés: 1000kg</li>\n	<li>Hátsó tengely terhelés: 1215kg</li>\n	<li>Kivéve x-Drive és M3 típusok</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E46, kivéve xDrive és M3, 1998-2007-ig, rövidített stabilizátor rúddal, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e46-kiveve-xdrive-es-m3-1998-2007-ig-roviditett-stabilizator-ruddal-sport-series-allithato-magassagu-futomu'),
(412, '', '<p>Az MTS-Technik állítható magasságú sport futóművei tökéletes választás azoknak, akik számára fontos a jó minőség és a kedvező ár. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<u>Termékjellemzők:</u>\n<ul>\n    <li>A futóművek rugóit az Eibach gyártja</li>\n    <li>A magasság széles tartományban állítható, általában 25 és 80 mm között</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém igénybevétel esetén is</li>\n    <li>Két rétegű bevonat a hosszantartó korrózióvédelemért</li>\n    <li>Tökéletes összhang rugó és lengéscsillapító között</li>\n    <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw E46 M3 Coupé, M3 Cabrio, 2000.07-2006.08-ig, rövidített stabilizátor rúddal, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e46-m3-coupe-m3-cabrio-2000-07-2006-08-ig-roviditett-stabilizator-ruddal-street-series-allithato-magassagu-futomu'),
(413, '', '<div> \\nAz egyedülálló Bmw E46 M3 autót korszerű V-Maxx sport futóművel látták el, melynek magassága és keménysége is könnyedén állítható.', 'V-Maxx Bmw E46 M3, kivéve CSL, 2000-2006-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e46-m3-kiveve-csl-2000-2006-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(414, '', '<div> <p><strong>Vogtland</strong> által állítható magasságú futómű szett a BMW 3-AS (E46) modellhez</p>  <ul> 	<li><strong>Évjárat</strong>: 2001-től</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 60 / 30 - 50 mm</li> 	<li><strong>Típus</strong>: BMW 3 E46, Typ 346K, Compact</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 935 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li> 	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW200GF02_1460-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW200GF02_1460-10.pdf</a></li> </ul>  <p>A Vogtland futómű szett nem csupán esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is maximalizálja. Az ültetés mértékét szabadon állíthatja a kívánt értékek között, így testre szabva az autót saját igényei szerint. A futómű kiváló minőségű, speciális kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett alapból 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművek vannak beépítve.</p>  <p>Gyártás helye: Németország!</p>  <p>Cikkszám: 968681</p> </div>', 'Vogtland Bmw E46 Compact, 2001.01-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e46-compact-2001-01-tol-allithato-magassagu-futomu'),
(415, '', '<div> <p><strong>Vogtland</strong> által állítható magasságú futómű szett BMW 3-AS (E46) modellekhez. A kit tervezésekor figyelembe vették a 1998-2007 között gyártott autók ültetési igényeit, melyek 30 - 70 mm között állíthatóak elöl és 30 - 50 mm között hátul. A kit megfelelő típusokhoz való, mint például a BMW 3 E46 Limuzin, Kombi, kupé és kabrió modellekhez, kivéve az M3-at és a négykerék-hajtású változatokat.</p>  <ul> 	<li><strong>Évjárat</strong>: 1998-2007</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 70 / 30 - 50 mm</li> 	<li><strong>Típus</strong>: BMW 3 E46, Typ 346L, 346C, 346R, Lim. / Sedan, Touring, Coupé, Cabrio, kivéve M3, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1030 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1215 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW200GF21-22_1468-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW200GF21-22_1468-10.pdf</a></li> </ul>  <p>A Vogtland futómű nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. A rugók és lengéscsillapítók minőségi anyagokból készültek, és a speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és dinamikát. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve a szintező vagy torziós futóművel rendelkező autóknál.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968394</p> </div> ', 'Vogtland Bmw E46, kivéve M3, 1998-2007-ig (első tengely terhelés 911-1000kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-e46-kiveve-m3-1998-2007-ig-els-tengely-terheles-911-1000kg-allithato-magassagu-futomu'),
(416, '', '<div> <p><strong>Vogtland</strong> által állítható magasságú futómű szett: BMW 3-AS (E36)</p>  <ul> 	<li><strong>Évjárat</strong>: 1998-2007-ig</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 70 / 30 - 50 mm</li> 	<li><strong>Típus</strong>: BMW 3 E46, Typ 346L, 346C, 346R, Lim. / Sedan, Touring, Coupé, Cabrio, kivéve M3, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 910 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1215 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a Vogtland futómű szett garantálja a maximális vezetési élményt. A beállítható ültetési magasságnak köszönhetően testre szabhatja az autó alacsonyabbra történő helyezését. A futómű kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Emellett a lengéscsillapítók első osztályú korrózióvédelmet nyújtanak.</p>  <p>A futómű TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A Vogtland már több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén.</p>  <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968393</p> </div>', 'Vogtland Bmw E46, kivéve M3, 1998-2007-ig (első tengely terhelés 910kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-e46-kiveve-m3-1998-2007-ig-els-tengely-terheles-910kg-alatt-allithato-magassagu-futomu'),
(417, '', '<div><span>Az Ap futómű ideális választás a sportosan ambiciózus vezetők számára, akik precízen be szeretnék állítani a kívánt üléspozíciót milliméter pontossággal. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kombinálva, maximális üléspozícióval.</span></div> <div><span>Egy alumínium rugótányér lehetővé teszi a jármű magasságának egyéni beállítását a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmóniáját egy optimális konfigurációval biztosítjuk.</span></div> <ul>     <li><span>Premium minőség elérhető áron</span></li>     <li><span>Egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiemelkedő ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Fontos! Ez a futómű csak a magasság beállítását teszi lehetővé! A keménység nem állítható!</span></div>', 'AP made by KW Bmw E46 M3, Coupé és Cabrio, 2000.06-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e46-m3-coupe-es-cabrio-2000-06-tol-allithato-magassagu-futomu'),
(418, '', '<div>\\r\\n<div>Az Ap futómű kifejezetten azok számára lett tervezve, akik szeretik vezetni autójukat sportosan és ambiciózusan. A futómű lehetőséget biztosít arra, hogy precízen beállítsd az ültetést a kívánt módon, milliméter pontossággal. A sportos irányíthatóság és a kiváló vezethetőség kombinációját nyújtjuk, miközben maximalizáljuk az ültetést.</div>\\r\\n\\r\\n<div>Az alumínium rugótányér segítségével könnyedén beállíthatod a jármű magasságát a TÜV által engedélyezett tartományon belül, személyre szabottan. A sportosság, kényelem és biztonság egyidejűleg történő összehangolása optimális felépítést eredményez.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Magas minőség alacsony áron</li>\\r\\n	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>Kitűnő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>Kiemelkedő ár-érték arány</li>\\r\\n	<li>Német gyártású minőség</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos figyelmeztetés! Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</div>\\r\\n</div>\\r\\n', 'AP made by KW Bmw E46 összes, kivéve Compact és M3, 1998.05-től, (első tengely terhelés 910kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e46-osszes-kiveve-compact-es-m3-1998-05-tol-els-tengely-terheles-910kg-alatt-allithato-magassagu-futomu'),
(419, '', '<div>\n<p>Az AP-Fahrwerke Állítható magasságú futóművet az alábbi autótípusokhoz ajánljuk:</p>\n\n<ul>\n	<li>BMW 3-as széria Limousine, Touring, Coupé, Cabrio, kivéve a M3 modellt</li>\n	<li>Tipuskód: E46</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1998.05-től</li>\n	<li>Tengelyterhelés elülső tengelyen: 1030 kg</li>\n	<li>Tengelyterhelés hátsó tengelyen: 1215 kg</li>\n	<li>Egyéb információk: Kivéve a négykerék-meghajtású modelleket! A gyári méretű gumiabroncsok és felnikombinációk esetén nyomtávszélesítő felszerelése szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-70 mm, hátul: 30-50 mm között állítható (termékünk nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>2 év garancia a termékre</li>\n</ul>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Bmw E46 összes, kivéve Compact és M3, 1998.05-től, (első tengely terhelés 911-1000kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e46-osszes-kiveve-compact-es-m3-1998-05-tol-els-tengely-terheles-911-1000kg-ig-allithato-magassagu-futomu'),
(420, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ülésmagasságot. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját nyújtjuk, miközben maximalizáljuk az ülésmagasságot.</div>\\r\\n\\r\\n<div>A járműmagasság beállítására egy alumínium rugótányér segítségével van lehetőség a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolásával optimális felépítést biztosítunk.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kivételes ár-érték arány</li>\\r\\n	<li>német minőségű</li>\\r\\n</ul>\\r\\n\\r\\n<div>Kérjük vegye figyelembe, hogy ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</div>\\r\\n', 'AP made by KW Bmw E46 Compact, 2001.01-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e46-compact-2001-01-tol-allithato-magassagu-futomu'),
(421, '', '<div><strong>Vogtland állítható magasságú sport futómű a Bmw E46 M3-hoz</strong></div> <div> </div> <div><span>Az alkatrész cikkszáma: 968318</span><br /> <br /> <span>Az ültetési tartomány az első tengelyen: 20-40mm</span><br /> <br /> <span>Az ültetési tartomány a hátsó tengelyen: 20-40mm</span><br /> <br /> <span>A maximális terhelhetőség az első/hátsó tengelyen: 990 kg / 1170 kg</span><br /> <br /> <span>Ez a futómű megfelel a TÜV előírásainak!</span></div>', 'Vogtland Bmw E46 M3, Coupé és Cabrio, 2000.06-tól állítható magasságú futómű', '', '', '', 'vogtland-bmw-e46-m3-coupe-es-cabrio-2000-06-tol-allithato-magassagu-futomu'),
(422, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div> <div> </div> <div>A BlueLine állítható magasságú futóművek kiváló minőségűek, minden típusra egyedileg tervezettek. A jármű magasságát egy kényelmes állítókulcs segítségével könnyedén állíthatjuk a megadott tartományon belül.</div> <div> </div> <div>- 19.3 TÜV minősítéssel büszkélkedhet</div> <div>- EPS technológiával kezelt, porfestett és horganyzott alkatrészekkel</div> <div> </div> <div>Ültetés mértéke az elülső tengelyen: 25 - 50 mm</div>', 'Jom Bochum Bmw E61 Touring, 2004-2010-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e61-touring-2004-2010-ig-blue-line-allithato-magassagu-futomu'),
(423, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A BlueLine sportfutóművek kiemelkedő minőséget képviselnek, mindegyik típus egyedi jellemzőkkel rendelkezik. Az autó magasságát egy speciális állítókulcs segítségével könnyedén beállíthatja a felhasználó.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>- 19.3 TÜV minősítéssel büszkélkedhet</div>\\r\\n\\r\\n<div>- EPS technológiával kezelt, porfestett és horganyzott alkatrészekkel rendelkezik</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső ültetés mértéke: 25 - 50 mm</div>\\r\\n\\r\\n<div>Hátsó ültetés mértéke: 25 - 50 mm</div>', 'Jom Bochum Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-blue-line-allithato-magassagu-futomu'),
(424, '', '<strong>Állítható magasságú sport futómű az MTS-Technik Street sorozatból</strong><br /><ul> <li>A futómű megfelelő a Bmw E60 Sedan és E61 Touring modellekhez</li> <li>A készlet tartalmazza az első rugókat</li> <li>Az első tengelyre jutó súly: 1070kg</li> <li>Elöl állítható ülésmagasság: 20-65mm</li> <li>A szerelési útmutató letölthető innen: <strong><a href=\\\"https://mtstechnik.com/data/links/73bcdfbc801a9c508c3da9684f7c2454/27008_7736.pdf\\\"><span style=\\\"color:#2980b9\\\">szerelési útmutató</span></a></strong></li> </ul><br /><p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akiknek fontos a kiváló minőség és a versenyképes ár. A futóművek fokozatmentesen állítható magassága könnyen igazítható az útviszonyokhoz, így biztosítva az optimális hasmagasságot. Az MTS-Technik futóművei rugalmasak és hatékonyak, a rugók és lengéscsillapítók tökéletes összhangban vannak.</p><br /><p><u>Termékjellemzők:</u></p><br /><ul> <li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> <li>A magasság szabadon állítható általában 25 és 80 mm között</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Magas hatékonyság extrém körülmények között</li> <li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> <li>Tökéletes összhang a rugók és lengéscsillapítók között</li> <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul><br /><p><u>Termék jellemzői:</u></p><br /><p><u><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" style=\\\"height:314px; width:400px\\\" /></u></p><br /><p><em>A honlap szöveges tartalmának és képeinek jogtiszta másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E60, E61 Touring, 2003-2010-ig, 1pár első, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e60-e61-touring-2003-2010-ig-1par-els-street-series-allithato-magassagu-futomu'),
(425, '', '<strong>Az MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>  <ul> 	<li>Az MTS-Technik Sport Series állítható futóművei kiváló választások azoknak, akik nem akarnak kompromisszumot kötni, mivel fokozatmentesen állítható magasságuknak köszönhetően könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően.</li> 	<li>A futóművekben az Eibach gyártotta rugókat találjuk, amelyek speciálisan a maximális sportosságot célozzák meg.</li> 	<li>A Sport Series létrehozásakor a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a fő szempont.</li> 	<li>A futóművekhez gáztöltésű lengéscsillapítók tartoznak, amelyek magas hatékonyságot biztosítanak extrém igénybevételek mellett is.</li> 	<li>A termék két rétegű bevonattal rendelkezik a hosszan tartó korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek.</li> 	<li>A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással, így maximális vezetési élményt nyújtanak.</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><u><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E60, E61 Touring, 2003-2010-ig, 1pár első, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e60-e61-touring-2003-2010-ig-1par-els-sport-series-allithato-magassagu-futomu'),
(426, '', '<div><strong>BMW E60 Sedan FK Automotive állítható magasságú sport futómű</strong></div>\\r\\n\\r\\n<div>Az E60 típusú BMW Sedanhoz tervezett sport futómű, melynek évjárata 2003 és 2010 között van.</div>\\r\\n\\r\\n<div>Ez a futómű nem alkalmazható xDrive, M5 vagy Touring típusú járműveken.</div>\\r\\n\\r\\n<div>Az elülső tengely terhelése 1070 kg, míg a hátsó tengelyé 1340 kg.</div>\\r\\n\\r\\n<div>A futómű Németországban gyártott TÜV engedéllyel rendelkezik, melyet a csomag tartalmaz.</div>\\r\\n\\r\\n<div>1 év teljes körű garanciával.</div>\\r\\n\\r\\n<div>Kiemelkedő minőségű termék, rendkívül vonzó áron kapható.</div>\\r\\n\\r\\n<div>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db kulcsot az állításhoz.</div>', 'FK-Automotive Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-allithato-magassagu-futomu'),
(427, '', '<div>\n<p style=\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\">\nA Bmw E60 Sedan V-Maxx futómű lehetőséget biztosít a magasság állítására.\n</p>\n</div>', 'V-Maxx Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-allithato-magassagu-futomu'),
(428, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás lehetnek azok számára, akik fontosnak tartják a kiváló minőséget és a versenyképes árakat. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveit a rugók és a lengéscsillapítók optimális egyensúlya jellemzi.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművekhez tartozó rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Rugó és lengéscsillapító tökéletes együttműködése</li>\n	<li>Az összeállítás plug & play, nem igényel módosításokat a felfüggesztésben</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><u><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-street-series-allithato-magassagu-futomu'),
(429, '', '<strong>Bmw E60 Sedan MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideálisak azok számára, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően.</li>\\r\\n	<li>A futóművek optimális összhangban vannak az Eibach gyártotta rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</li>\\r\\n	<li>Termékjellemzők:</li>\\r\\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\\r\\n	<li>Speciális Eibach rugók a maximális sportosság érdekében.</li>\\r\\n	<li>A Sport Series létrehozása során a fokozott vezetési élmény elérése volt a cél a szélesebb ültetési tartomány mellett.</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém igénybevétel esetén is.</li>\\r\\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek.</li>\\r\\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\\r\\n</ul>\\r\\n\\r\\n<p>Ne felejtsd el, hogy a weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</p>\\r\\n', 'MTS-Technik by Nord Performance Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-sport-series-allithato-magassagu-futomu'),
(430, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás lehet BMW 5-ÖS (E60 / E61) típusú autókhoz. Ez a futómű kimagasló minőséget és vezetési élményt nyújt. A futómű beállítása lehetővé teszi az ültetés mértékének személyre szabott beállítását. A készlet tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek első osztályú minőségben.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel rendelkeznek.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968067</p>', 'Vogtland Bmw E61 Touring, 2004.06-tól, (első tengely terhelés 1070kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-e61-touring-2004-06-tol-els-tengely-terheles-1070kg-alatt-allithato-magassagu-futomu'),
(431, '', '<p>Egy állítható magasságú futómű szett, mely kifejezetten a BMW 5-ÖS E60 típushoz lett tervezve. A futóművet 2003.01-től kezdve lehet használni, és lehetőség van az ültetés mértékének 25 - 55 mm közötti beállítására. Ez a speciális készlet magában foglalja a BMW 5 E60 típusú járművekhez szükséges kétcsöves lengéscsillapítókat, melyek kiváló kényelmet és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítókat kiváló minőségű korrózióvédelemmel látták el.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éve van jelen a rugógyártás területén, 2 év garanciát biztosít az ültetőrugókra és lengéscsillapítókra. A szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autóknál, melyek szintezővel vagy torziós futóművel rendelkeznek.</p>\n<p>A termék Made in Germany!</p>\n<p>Cikkszám: 968066</p>', 'Vogtland Bmw E60 Sedan, 2003.01-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e60-sedan-2003-01-tol-allithato-magassagu-futomu'),
(432, '', '<div>\n<p>Ez az állítható magasságú futómű alkalmas a következő autótípushoz: <ul> <li>BMW 5-ös széria Touring</li> <li>Tipuskód: E61</li> <li>Típus variáció: Touring</li> <li>Évjárat: 2004.06-tól</li> <li>Tengelyterhelés elöl (kg): 1070</li> <li>Tengelyterhelés hátul (kg): 1300</li> <li>Egyéb kitételek: A gyári méretű gumi és felnikombinációhoz nyomtávszélesítő szükséges! A hátsó sportfutómű légrugóval van felszerelve, amelyet meg kell őrizni. Az autó ültetése csak az előírásoknak megfelelően végezhető el.</li> </ul> </p>\n</div>\n<div>\n<ul>\n<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n<li>Az engedélyben meghatározott ültetési tartomány elöl: 25-45 mm, hátul: 25-45 mm között állítható (bár nagyobb intervallumban is). A TÜV engedély csak az említett beállításokra vonatkozik.</li>\n<li>Extra ültetési lehetőség elöl: +35 mm, hátul: +55 mm</li>\n</ul>\n</div>\n<div>\n<ul>\n<li>Gyártó: Ap-Fahrwerke, Németország</li>\n<li>Garancia: 2 év</li>\n</ul>\n</div>\n<div>\n<p><strong>Cikkszám: GF20-045</strong></p>\n<p>Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Bmw E61 Touring, 2004.06-tól, (első tengely terhelés 1070kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e61-touring-2004-06-tol-els-tengely-terheles-1070kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(433, '', '<p>Ez az állítható magasságú AP-Fahrwerke futómű illeszkedik a következő autótípushoz:</p>\n<ul>\n	<li>Autótípus: BMW 5-ös széria Limousine</li>\n	<li>Tipuskód: E60</li>\n	<li>Típus variáció: Limousine</li>\n	<li>Évjárat: 2003.07-től</li>\n	<li>Tengelyterhelés elöl (kg): 1070</li>\n	<li>Tengelyterhelés hátul (kg): 1235</li>\n	<li>Egyéb kitételek: Kivéve olyan modellek, amelyek automata szintszabályzóval vannak felszerelve vagy amelyekhez automatikusan szintszabályzó felszerelhető.<br /> A gyári méretű gumiabroncsok és felnik kombinációjánál nyomtávszélesítő felszerelése szükséges!</li>\n</ul>\n<ul>\n	<li>Ez a futóműszett német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedély által meghatározott ültetés mértéke elöl: 25-55 mm, hátul: 25-55 mm között állítható<br /> (A futómű mindig nagyobb intervallumban állítható, de a TÜV engedély csak a fenti beállításokat fogadja el.)</li>\n	<li>Plussz ültetés lehetőség elöl: +40 mm, hátul: +0 mm</li>\n</ul>\n<ul>\n	<li>Gyártó: Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF20-005</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Bmw E60 Sedan, 2003.07-től, (első tengely terhelés 1070kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e60-sedan-2003-07-tol-els-tengely-terheles-1070kg-alatt-allithato-magassagu-futomu'),
(434, '', '<strong>Bmw E60 Eibach Pro Street S állítható futómû</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A Bmw E60 Sedan modellekhez kínált Eibach Pro Street S állítható futómű rendkívüli lehetőségeket kínál a teljesítmény és kényelem terén.</li>\\r\\n	<li>A futómű alkalmazható többféle motorváltozathoz, mint például a 520i, 523i, 525i, 528i, 530i, 535i, 540i, 520d, 525d, 525td, 525tds, 530d.</li>\\r\\n	<li>Az első tengely terhelése 1070 kg alatt, míg a hátsó tengely terhelése 1235 kg alatt marad.</li>\\r\\n	<li>Az ültetés mértéke az első és hátsó tengelynél egyaránt 25-55 mm között állítható.</li>\\r\\n</ul>\\r\\n\\r\\n<p>Termékjellemzők:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Az Eibach Pro Street S futóművek mindegyike rendelkezik TÜV minősítéssel, biztosítva ezzel a magas színvonalú minőséget.</li>\\r\\n	<li>Ez a futómű megfelelő választás azoknak, akik a sportosságot és a kényelmet is fontosnak tartják.</li>\\r\\n	<li>A gyártás DIN ISO/TS 16949 szabvány szerint történik, garantálva a megbízhatóságot.</li>\\r\\n	<li>A Eibach Motorsport által szerzett tapasztalatok (Forma 1, Rally, túrabajnokság) inspirálták a futóművek tervezését és kivitelezését.</li>\\r\\n	<li>A magasság fokozatmentesen állítható a speciális polyamid rugótányér segítségével, biztosítva a rugalmas beállítást.</li>\\r\\n	<li>A futómű rozsdamentes kivitele hosszú élettartamot és megbízhatóságot garantál.</li>\\r\\n	<li>A vásárlástól számított 24 hónapos garancia teljes körű védelmet nyújt a vevőknek.</li>\\r\\n</ul>\\r\\n', 'Eibach Bmw E60 Sedan, 2003.07-2010.03-ig, (első tengely terhelés 1070kg alatt), Pro Street S állítható magasságú futómű', '', '', '', 'eibach-bmw-e60-sedan-2003-07-2010-03-ig-els-tengely-terheles-1070kg-alatt-pro-street-s-allithato-magassagu-futomu'),
(435, '', '<div>\\r\\n<div><strong>Állítható magasságú sport futómű BMW E60 szedánhoz - Bilstein B14</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az alábbi modellekre nem alkalmazható: M5, Touring</div>\\r\\n\\r\\n<div>Fedélzet magassága elöl: 30 - 50 mm</div>\\r\\n\\r\\n<div>Fedélzet magassága hátul: 30 - 50 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső tengely maximális terhelhetősége: 1070 kg</div>\\r\\n\\r\\n<div>Hátsó tengely maximális terhelhetősége: 1300 kg</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel!</div>\\r\\n</div>\\r\\n', 'Bilstein Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-bilstein-b14-allithato-magassagu-futomu'),
(436, '', '<div><strong>Bmw E60 Sedan Bilstein B16 PSS10 sport futómű állítható magassággal és keménységgel</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Kizárva: M5, Touring</div>\\r\\n\\r\\n<div>10 féle keménységbeállítás!</div>\\r\\n\\r\\n<div>Fedélzetes magasság elöl: 30 - 50 mm</div>\\r\\n\\r\\n<div>Fedélzetes magasság hátul: 30 - 50 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső tengely terhelhetőség: 1070 kg alatt</div>\\r\\n\\r\\n<div>Hátsó tengely terhelhetőség: 1300 kg alatt</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A termék rendelkezik TÜV engedéllyel!</div>\\r\\n', 'Bilstein Bmw E60 Sedan, kivéve M5 és Touring, 2003-2010-ig, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-bmw-e60-sedan-kiveve-m5-es-touring-2003-2010-ig-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(437, '', '<strong>Bmw E65 MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik által gyártott állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A futóművek fokozatmentesen állítható magasságúak, így könnyedén lehet igazítani az autó hasmagasságát az útviszonyokhoz. Az MTS-Technik futóművei esetében tökéletes egyensúly van a rugók és a lengéscsillapítók között.</p>  <p><u>Az alábbi típusokhoz megfelelő:</u></p>  <ul> 	<li><strong>Bmw E65, </strong>730i, Li / 735i, Li / 740i, Li / 745 i, Li / 750i, Li / 760i, Li / 730d / 730 Ld / 740d / 745d</li> 	<li>Elülső ültetés: 40-75mm</li> 	<li>Hátsó ültetés: 30-80mm</li> 	<li>Elülső tengely teherbírás: 1295kg</li> 	<li>Hátsó tengely teherbírás: 1410kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság legtöbb esetben 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Extrém igénybevétel mellett is magas hatékonyság</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes egyensúlya</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldalon található szöveges tartalmak és képek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw E65, 2001.07-2009.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e65-2001-07-2009-12-ig-street-series-allithato-magassagu-futomu'),
(438, '', '<p>Egy állítható magasságú sport futómű, mely tökéletes választás számos Bmw modellhez, kezdve az E90 Sedantól egészen az E92 Coupéig. Az MTS-Technik futóművek 2005.09-től érhetők el, kivéve az xDrive modelleket és az M3-at. Ez a futómű lehetőséget biztosít a magasság fokozatmentes állítására, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóművei ideális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém körülmények között is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n	<li>A futómű beszereléséhez rövidített stabilizátor szett használata ajánlott! A szett NEM tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Bmw E81, E82, E87, E88, 2004-től, Street Series ', '', '', '', 'mts-technik-by-nord-performance-bmw-e81-e82-e87-e88-2004-tol-street-series-'),
(439, '', '<p>A <strong>MTS-Technik Sport állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága fokozatmentesen. Az <strong>MTS-Technik Sport futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, így maximális vezetési élményt biztosítanak széles ültetési tartománnyal.</p>  \n<p><u>A következő típusokhoz passzol:</u></p>  \n<ul>  \n	<li><strong>BMW E90 Sedan</strong>, 316i / 318i / 320i / 320si / 323i / 325i / 330i / 335i / 316d / 318d / 320d / 325d / 330d / 335d</li>  \n	<li><strong>BMW E92 Coupé</strong>, 316i / 318i / 320i / 323i / 325i / 330i / 335i / 320d / 325d / 330d / 335d</li>  \n	<li>ültetés mértéke elöl: 20-55mm</li>  \n	<li>ültetés mértéke hátul: 30-70mm</li>  \n	<li>első tengely terhelés: 1090kg</li>  \n	<li>hátsó tengely terhelés: 1135kg</li>  \n	<li>kivéve x-Drive modellek</li> </ul>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>  \n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li>  \n	<li>gáztöltéses lengéscsillapítók</li>  \n	<li>magas hatékonyság extrém igénybevétel mellett is</li>  \n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  \n<p><u><strong>Termék karakterisztika:</strong></u></p>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p> ', 'MTS-Technik by Nord Performance Bmw E81, E82, E87, E88, 2004-től, Sport Series ', '', '', '', 'mts-technik-by-nord-performance-bmw-e81-e82-e87-e88-2004-tol-sport-series-'),
(440, '', '<strong>V-Maxx változtatható magasságú és keménységű sport futómű</strong>\\n\\n<ul>\\n  <li>Bmw E81, 116i / 118i / 120i / 130i / 116d / 118d / 120d / 123d, 2004-2011.08-ig</li>\\n  <li>Bmw E82, 120i / 125i / 135i / M / 118d / 120d / 123d, 2007.10-2013.11-ig</li>\\n  <li>Bmw E87, 116i / 118i / 120i / 130i / 116d / 118d / 120d / 123d, 2004-2011.08-ig</li>\\n  <li>A beszerelés során ajánlott rövidített stabilizátorrúd használata! A csomag nem tartalmazza, ára 15.900Ft/pár</li>\\n  <li><strong>20 különböző keménységi fokozatban állítható!</strong></li>\\n  <li>Első tengely terhelés: 1005kg</li>\\n  <li>Hátsó tengely terhelés: 1070kg</li>\\n  <li>Elülső ültetés mértéke: 35-65mm</li>\\n  <li>Hátsó ültetés mértéke: 35-55mm</li>\\n  <li>Letölthető dokumentumok: <strong><a href=\\\"https://www.v-maxx.com/storage/files/TUV/70%20BM%2009.pdf\\\"><span style=\\\"color:#2980b9\\\">TÜV engedély</span></a></strong><span style=\\\"color:#2980b9\\\">, </span><strong><a href=\\\"https://www.v-maxx.com/storage/files/INST.INSTRUCTIES/065.pdf\\\"><span style=\\\"color:#2980b9\\\">szerelési útmutató</span></a></strong></li>\\n</ul>\\n\\n<p><em>A honlap szöveges tartalmának, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'V-Maxx Bmw E81, E82, E87, 2004-től, állítható keménységű futómű', '', '', '', 'v-maxx-bmw-e81-e82-e87-2004-tol-allithato-kemenysegu-'),
(441, '', '<strong>V-Maxx állítható magasságú és keménységű sport futómű</strong><br /><ul><br /><li>Az alábbi Bmw modellekhez tervezve: E88, 118i / 120i / 125i / 135i / 118D / 120D / 123D, gyártási időszak: 2008.03-2013.12</li><br /><li>A beszereléshez ajánlott rövidített stabilizátorrúd külön megvásárolható, ára: 15.900Ft/pár</li><br /><li><strong>20 különböző keménységi fokozat állítható</strong></li><br /><li>Az első tengely maximális terhelhetősége: 1005kg</li><br /><li>A hátsó tengely maximális terhelhetősége: 1070kg</li><br /><li>Elülső ültetés mértéke: 35-65mm</li><br /><li>Hátsó ültetés mértéke: 35-55mm</li><br /><li>Elérhető dokumentumok: <strong><a href=\\\"https://www.v-maxx.com/storage/files/TUV/70%20BM%2009.pdf\\\"><span style=\\\"color:#2980b9\\\">TÜV engedély</span></a><span style=\\\"color:#2980b9\\\">, </span><a href=\\\"https://www.v-maxx.com/storage/files/INST.INSTRUCTIES/065.pdf\\\"><span style=\\\"color:#2980b9\\\">szerelési útmutató</span></a></strong></li><br /></ul><br /><p><em>A honlap tartalmának és képeinek jogtalan másolása és terjesztése tilos!</em></p>', 'V-Maxx Bmw E88, 2008.03-2013.12-ig, állítható keménységű futómű ', '', '', '', 'v-maxx-bmw-e88-2008-03-2013-12-ig-allithato-kemenysegu-'),
(442, '', '<div>\n<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetőknek, hogy milliméter pontossággal állítsák be a kívánt ülésmagasságot. Az optimális vezethetőség és sportos irányíthatóság kombinációját nyújtjuk a maximális ültetés mellett.</div>\n\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság egyensúlyban van, így optimális felépítést biztosítunk.</div>\n\n<ul>\n	<li>kiváló minőség elérhető áron</li>\n	<li>egyedi magasságbeállítás a TÜV által jóváhagyott tartományon belül</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>kiemelkedő ár-érték arány</li>\n	<li>német minőség</li>\n</ul>\n</div>', 'AP made by KW Bmw E81, E82, E87, 2004.09-2011.08-ig ', '', '', '', 'ap-made-by-kw-bmw-e81-e82-e87-2004-09-2011-08-ig-'),
(443, '', '<div> <span>Az Ap futómû olyan lehetőséget biztosít a sportosan ambiciózus vezetőknek, hogy a kívánt üléspozíciót milliméterre pontosan beállíthassák. Az optimális vezetési élményt és sportos irányíthatóságot a maximális ülésmagassággal ötvözzük.</span></div> <div><span>Az alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság tökéletes egyensúlyát teremtjük meg a jármű optimális beállításával.</span></div> <ul>     <li><span>Kiemelkedő minőség, megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Magas minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kivételes ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Bmw E88, 2008.03-tól ', '', '', '', 'ap-made-by-kw-bmw-e88-2008-03-tol-'),
(444, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: BMW 1-ES (E82)</span></div>  <ul> 	<li><strong>Évjárat</strong>: 2007.10-től</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: BMW 1 E82, Typ 182, 1C, Coupé, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elől</strong>: 945 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1070 kg</li> </ul>  <p>Az autó megjelenését javító Vogtland állítható magasságú futómű szett nemcsak esztétikus, hanem kiváló vezetési élményt is nyújt. A rugalmas ültetési lehetőségek lehetővé teszik az egyéni beállításokat az ön igényei szerint. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és dinamikus vezetést. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  <p>A termék megfelel a szigorú TÜV minőségi előírásoknak. A gyártó cég, mely több mint száz éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968174</p> ', 'Vogtland Bmw E82, 2007.10-től ', '', '', '', 'vogtland-bmw-e82-2007-10-tol-'),
(445, '', '<div><strong>Vogtland</strong><span> futómű szett</span><span>: BMW 1-ES (E88)</span></div>  \n<ul> 	\n<li><strong>Évjárat</strong>: 2008.03-tól</li> 	\n<li><strong>Ültetés mértéke</strong>: 30 - 55 / 25 - 50 mm</li> 	\n<li><strong>Típus</strong>: BMW 1 E88, Typ 182, 1C, Cabrio, kivéve 4WD</li> 	\n<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li> 	\n<li><strong>Max. tengelyterhelés hátu</strong>: 1120 kg</li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét könnyedén beállíthatja az ön igényei szerint. A készlet magas minőségű, kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a dinamikus vezetést. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  \n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  \n<p>Gyártva Németországban!</p>  \n<p>Cikkszám: 968175</p> ', 'Vogtland Bmw E88, 2008.03-tól ', '', '', '', 'vogtland-bmw-e88-2008-03-tol-'),
(446, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 1-ES E81, E87</p>  <ul> 	<li><strong>Évjárat</strong>: 2004.09-től</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: BMW 1 E81, E87, Typ 187, 1K2, 1K4, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 945 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1070 kg</li> 	<li> </li> </ul>  <p>Az autó külső megjelenésének javítása mellett teljesen új vezetési élményt nyújt ez a futómű szett. Az ültetés magasságát szabadon állíthatja a kívánt értékek között, szem előtt tartva saját elképzeléseit. A kiváló minőségű futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  <p>Ez a termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A csomag alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968395</p> ', 'Vogtland Bmw E81, E87, 2004.09-től ', '', '', '', 'vogtland-bmw-e81-e87-2004-09-tol-'),
(447, '', '<p>BILSTEIN B14 PSS egy rendkívül hatékony egycsöves rendszer, mely Upside-Down technológiát alkalmaz. A versenysportrugók nagy szilárdságú anyagból készülnek, és állítható magasságot biztosítanak (az alumíniumból készült rugótányér és kontra anya révén). A B14 PSS a BILSTEIN versenysport technológiáját hozza az utcai használatra, melyet a BILSTEIN mérnökei álmodtak meg. Ennek a rendszernek az egyik nagy előnye, hogy a jármű magassága akár 50 mm-rel is csökkenthető az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű egycsöves Upside-Down technológia a B14 PSS esetében garantálja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</p>', 'Bilstein Bmw E81, E87, 2006.09-2012.09-ig, Bilstein B14 ', '', '', '', 'bilstein-bmw-e81-e87-2006-09-2012-09-ig-bilstein-b14-'),
(448, '', '<p>BILSTEIN B14 PSS egy egycsöves rendszer, mely Upside-Down technológiával van ellátva. A versenysportrugók nagy szilárdságú anyagból készülnek, és állítható magassággal rendelkeznek, ahol a rugótányér és a kontra anya alumíniumból készül. A B14 PSS segítségével a jármű magassága csökkenthető akár 50 mm-rel az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Ez az extrém terhelhető egycsöves Upside-Down technológiával rendelkező rendszer biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmények között.</p>', 'Bilstein Bmw E82, 2007.10-től ', '', '', '', 'bilstein-bmw-e82-2007-10-tol-'),
(449, '', '<p>A Bilstein B14 PSS egy egycsöves rendszer, ami Upside-Down technológiával van ellátva. A versenysportrugók nagy szilárdságú anyagból készülnek, és állítható magassággal rendelkeznek (az alumíniumból készült rugótányér és kontra anya révén). A B14 PSS a BILSTEIN mérnökeinek versenysport technológiáját hozza az utcára, lehetővé téve a jármű magasságának csökkentését akár 50 mm-rel az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben a B14 PSS segítségével.</p>', 'Bilstein Bmw E88, 2008.03-tól ', '', '', '', 'bilstein-bmw-e88-2008-03-tol-'),
(450, '', '<p>Egy állítható magasságú sport futómű, amely a BMW E90 Sedan, E91 Touring, E92 Coupe és E93 Cabrio modellekhez készült.</p>\\r\\n\\r\\n<p>Ez a futómű kizárólag az E90, E91, E92 és E93 típuskódú modellekhez megfelelő.</p>\\r\\n\\r\\n<p>Használható az 2005-2008 közötti években gyártott modellekhez.</p>\\r\\n\\r\\n<p>A magasságállító a hátsó tengelynél a rugó alatt található.</p>\\r\\n\\r\\n<p>A futómű beszereléséhez javasolt rövidített stabilizátor szett. A szett nem tartozék, de kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix).</p>\\r\\n\\r\\n<p>A tengelyterhelés elöl 1020 kg, míg hátul 1315 kg.</p>\\r\\n\\r\\n<p>MADE IN GERMANY</p>\\r\\n\\r\\n<p>A futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>A szett tartalmaz 4 darab lengéscsillapítót a hozzá tartozó rugókkal és egy kulccsal az állításhoz.</p>\\r\\n', 'Jom Bochum Bmw E90, E91, E92, E93, kivéve xDrive, 2005-2008-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-e90-e91-e92-e93-kiveve-xdrive-2005-2008-ig-blue-line-allithato-magassagu-futomu'),
(451, '', '<p><strong>FK-Automotive AK Street Állítható Magasságú Futómû a BMW E90 Sedan és E91 Touring modellekhez</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: E90 Sedan, E91 Touring</li>\\r\\n	<li>Kivéve: iX és M3</li>\\r\\n	<li>Évjárat: 2004.06-2012.06</li>\\r\\n	<li>Elsõ tengely terhelés: 1035kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1315kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Elöl és hátul is változtatható a magassága</li>\\r\\n	<li>Nagy tartományban változtatható a magassága</li>\\r\\n	<li>Az egyik legjobb alap szintû állítható futómû</li>\\r\\n	<li>Kiváló minõségű anyagok felhasználásával készült</li>\\r\\n	<li>Sportos, feszes és hosszú élettartamú</li>\\r\\n	<li>Javítja a kanyarstabilitást és a vezetési élményt</li>\\r\\n	<li>TÜV engedéllyel rendelkezik</li>\\r\\n	<li>Állítható ültetési magasság: 25-55 mm között</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Cikkszám: SMBM9003</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E90, E91, kivéve iX és M3, 2004.06-2012.06-ig állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e90-e91-kiveve-ix-es-m3-2004-06-2012-06-ig-allithato-magassagu-futomu'),
(452, '', '<p><strong>Bmw E93 FK-Automotive AK Street Állítható Magasságú Futómû</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: E93 Cabrio</li>\\r\\n	<li>Kivéve: iX és M3</li>\\r\\n	<li>Évjárat: 2007-2013</li>\\r\\n	<li>Elsõ tengely terhelés: 1035kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1315kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű elöl és hátul is állítható magasságú</li>\\r\\n	<li>Ez az FK-Automotive AK Street futómű lehetővé teszi a nagy intervallumban történő magasságállítást</li>\\r\\n	<li>Kiemelkedő minőségű alap szintű állítható futómű, mely sportos, feszes és rendkívül strapabíró</li>\\r\\n	<li>Hozzájárul a kanyarstabilitás és a vezetési élmény növeléséhez</li>\\r\\n	<li>A termék TÜV engedéllyel rendelkezik és anyaga acél</li>\\r\\n	<li>Az ültetés mértéke körülbelül 25-55 mm között állítható</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Cikkszám: SMBM9004-02</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E93 Cabrio, kivéve iX és M3, 2007-2013-ig állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e93-cabrio-kiveve-ix-es-m3-2007-2013-ig-allithato-magassagu-futomu'),
(453, '', '<p><strong>FK-Automotive AK Street állítható magasságú futómű a BMW E92 Coupé modellekhez</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: E92 Coupé</li>\\r\\n	<li>Kivéve: iX és M3</li>\\r\\n	<li>Évjárat: 2005-2012</li>\\r\\n	<li>Első tengely terhelés: 1035 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1315 kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Elöl és hátul egyaránt szabályozható a magassága</li>\\r\\n	<li>Nagy skálán állítható magasság</li>\\r\\n	<li>Kiemelkedő alapszintű állítható futómű</li>\\r\\n	<li>Kiváló minőségű kivitelezés</li>\\r\\n	<li>Sportos, szilárd és tartós</li>\\r\\n	<li>Javítja a kanyarstabilitást és a vezetési élményt</li>\\r\\n	<li>TÜV tanúsítvánnyal rendelkezik</li>\\r\\n	<li>Az ülésmagasság 25-55 mm között állítható</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Cikkszám: SMBM9004</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Bmw E92 Coupé, kivéve iX és M3, 2005-2012-ig állítható magasságú futómű', '', '', '', 'fk-automotive-bmw-e92-coupe-kiveve-ix-es-m3-2005-2012-ig-allithato-magassagu-futomu'),
(454, '', '<div>\n  <p>\n    <em>A BMW E91 és E93 modellek számára tervezett sport futómű egyedi funkciókkal, melynek magassága állítható a forradalmi V-Maxx technológiával.</em>\n  </p>\n</div>', 'V-Maxx Bmw E91, E93, kivéve 4WD, 2005.09-től állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e91-e93-kiveve-4wd-2005-09-tol-allithato-magassagu-futomu'),
(455, '', '<br /><div><br /><strong>A Bmw E90 és E92 modellekhez sportos, magasságában állítható futómű</strong><br /></div><br />', 'V-Maxx Bmw E90, E92, kivéve 4WD, 2005.04-től állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e90-e92-kiveve-4wd-2005-04-tol-allithato-magassagu-futomu'),
(456, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik Sport futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Az alábbi típusokhoz passzol:</u></p>\n<ul>\n	<li>BMW E90 Sedan, 316i / 318i / 320i / 320si / 323i / 325i / 330i / 335i / 316d / 318d / 320d / 325d / 330d / 335d</li>\n	<li>BMW E92 Coupé, 316i / 318i / 320i / 323i / 325i / 330i / 335i / 320d / 325d / 330d / 335d</li>\n	<li>Ültetés mértéke elöl: 20-55mm</li>\n	<li>Ültetés mértéke hátul: 30-70mm</li>\n	<li>Első tengely terhelés: 1090kg</li>\n	<li>Hátsó tengely terhelés: 1135kg</li>\n	<li>Kivéve x-Drive modellek</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszútávú korrózióvédelemért</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Bmw E90, E92, kivéve xDrive, 2005.04-től, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e90-e92-kiveve-xdrive-2005-04-tol-sport-series-allithato-magassagu-futomu'),
(457, '', '<p>A <strong>MTS-Technik Comfort Series</strong> állítható magasságú sport futóművei ideális választás azoknak, akiknek fontos a sportos megjelenés mellett az utazási kényelem is! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az <strong>MTS-Technik Comfort</strong> futóművei tökéletes egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik</strong> lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>\n<ul>\n	<li><strong>BMW E90 Sedan</strong>: 316i / 318i / 320i / 320si / 323i / 325i / 330i / 335i / 316d / 318d / 320d / 325d / 330d / 335d</li>\n	<li><strong>BMW E92 Coupé</strong>: 316i / 318i / 320i / 323i / 325i / 330i / 335i / 320d / 325d / 330d / 335d</li>\n	<li>Ültetés mértéke elöl: 20-50mm</li>\n	<li>Ültetés mértéke hátul: 30-65mm</li>\n	<li>Elülső tengely terhelés: 1090kg</li>\n	<li>Hátsó tengely terhelés: 1135kg</li>\n	<li>Kivéve x-Drive modellek</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>A <strong>Comfort Series</strong> célja a magas kényelem, nem az extrém ültetés</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelésnél is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért</li>\n	<li>Tökéletes összhang rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosításokat a felfüggesztésben</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Bmw E90, E92, kivéve xDrive, 2005.04-től, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e90-e92-kiveve-xdrive-2005-04-tol-comfort-series-allithato-magassagu-futomu'),
(458, '', '<p>A <strong>MTS-Technik Sport állítható magasságú sport futómű</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> tökéletes összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva a maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Alkalmas a következő típusokhoz:</u></p>\n<ul>\n	<li><strong>BMW E91 Touring</strong>, 316i / 318i / 320i / 323i / 325i / 330i / 335i / 316d / 318d / 320d / 325d / 330d / 335d</li>\n	<li><strong>BMW E93 Cabrio</strong>, 318i / 320i / 323i / 325i / 330i / 335i / 320d / 325d / 330d</li>\n	<li>Ültetés mértéke elöl: 20-55mm</li>\n	<li>Ültetés mértéke hátul: 30-70mm</li>\n	<li>Első tengely terhelés: 1020kg</li>\n	<li>Hátsó tengely terhelés: 1200kg</li>\n	<li>Kivéve x-Drive modellek</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li><strong>Eibach</strong> rugók</li>\n	<li>Speciális <strong>Eibach rugók</strong> sportos teljesítményhez</li>\n	<li>A <strong>Sport Series</strong> célja a széles ültetési tartomány és a fokozott vezetési élmény</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelemért</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>Plug & play készlet, nem szükséges módosítás a felfüggesztésen</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Bmw E91, E93, kivéve xDrive, 2005.04-től, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e91-e93-kiveve-xdrive-2005-04-tol-sport-series-allithato-magassagu-futomu'),
(459, '', '<p>A <strong>MTS-Technik Comfort Series sport futóművei</strong> ideális választás azoknak, akik szeretnének sportosabb megjelenést és jobb utazási kényelmet egyaránt. A futómű fokozatmentesen állítható magassága könnyedén alkalmazkodik az útviszonyokhoz. Az <strong>MTS-Technik Comfort futóművek</strong> tökéletes egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között.</p>\n\n<u>Ez a futómű tökéletesen illik a következő típusokhoz:</u>\n<ul>\n    <li><strong>BMW E91 Touring</strong>, 316i / 318i / 320i / 323i / 325i / 330i / 335i / 316d / 318d / 320d / 325d / 330d / 335d</li>\n    <li><strong>BMW E93 Cabrio</strong>, 318i / 320i / 323i / 325i / 330i / 335i / 320d / 325d / 330d</li>\n    <li>Ültetés mértéke elöl: 20-50mm</li>\n    <li>Ültetés mértéke hátul: 30-65mm</li>\n    <li>Első tengely terhelés: 1020kg</li>\n    <li>Hátsó tengely terhelés: 1200kg</li>\n    <li>Kivéve x-Drive modellek</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n<ul>\n    <li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n    <li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n    <li>A <strong>Comfort Series</strong> fókuszában a magas kényelem áll</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém igénybevételek mellett is</li>\n    <li>Két rétegű bevonat hosszantartó korrózióvédelemmel</li>\n    <li>Tökéletes összhang rugó és lengéscsillapító között</li>\n    <li>A készlet plug & play, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n\n<u><strong>Termék jellemzői:</strong></u>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Bmw E91, E93, kivéve xDrive, 2005.04-től, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-e91-e93-kiveve-xdrive-2005-04-tol-comfort-series-allithato-magassagu-futomu'),
(460, '', '<strong>Testre szabható sport futómű állítható magassággal és keménységgel</strong><br /><ul><br /><li>Egyedi autómodellekhez tervezett futómű</li><br /><li>Kiemelkedő minőségű alapanyagok felhasználásával készült</li><br /><li>Nem kompatibilis az iX és M3 modellekkel</li><br /><li>Legnagyobb első tengelyterhelés: 1005 kg</li><br /><li>Elülső ültetés szabályozható: 35 - 65 mm</li><br /><li>Hátsó ültetés szabályozható: 35 - 65 mm</li><br /><li>Keménység 20 különböző fokozatban állítható</li><br /><li><strong>A stabilizátor rúd rövidített verziójának ajánlott használata</strong></li><br /><li>A futómű rendelkezik TÜV engedéllyel</li><br /></ul>', 'V-Maxx Bmw E90, E92, kivéve 4WD, 2005-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e90-e92-kiveve-4wd-2005-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(461, '', '<strong>Állítható magasságú és keménységű sport futómű a Bmw E90, E92 modellekhez</strong><br /><ul><br /><li>A következő Bmw E90 modellekhez megfelelő: 316i / 318i / 320i / 325i / 330i / 335i / 318D / 320D / 3250D / 330D / 335D</li><br /><li>A következő Bmw E92 modellekhez megfelelő: 320i / 325i / 330i / 335i / 320D / 3250D / 330D / 335D</li><br /><li>Kivételt képeznek az iX és M3 modellek</li><br /><li>Az első tengely maximális terhelése 1005 kg lehet</li><br /><li>Elülső ültetés mértéke állítható 35 - 65 mm között</li><br /><li>Hátsó ültetés mértéke szintén állítható 35 - 65 mm között</li><br /><li>A futómű keménysége 20 fokozatban szabályozható</li><br /><li><strong>Javasolt használni a rövidített stabilizátor rudat</strong></li><br /><li>A termék rendelkezik TÜV engedéllyel</li><br /></ul>', 'V-Maxx Bmw E90, E92, kivéve 4WD, 2005.04-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-e90-e92-kiveve-4wd-2005-04-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(462, '', '<div>\n<p>Ez a magasságállítható AP-Fahrwerke futómű kompatibilis az alábbi autótípusokkal:</p>\n\n<ul>\n	<li>BMW 3-as sorozat Cabrio és Touring modellek</li>\n	<li>Tipuskód: E93, E91</li>\n	<li>Típus változat: Cabrio, Touring</li>\n	<li>Évjárat: 2007.03-tól</li>\n	<li>Tengelyterhelés elöl (kg): 1090</li>\n	<li>Tengelyterhelés hátul (kg): 1200</li>\n	<li>Egyéb megjegyzés: Kivéve olyan modellek, melyek négykerék-meghajtással rendelkeznek!<br />\n	A gyári méretű abroncsok és felnik használata esetén nyomtávszélesítő felszerelése szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futómű összeállítás rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedély által meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 20-50 mm között állítható<br />\n	(Mindig nagyobb intervallumban is beállítható a futómű, de a TÜV engedély csak az említett beállításokra vonatkozik.)</li>\n	<li>További ültetési lehetőség elöl: +35 mm, hátul: +15 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11520033</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Bmw E91, E93, 2005.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e91-e93-2005-09-tol-allithato-magassagu-futomu'),
(463, '', 'Ez az állítható magasságú futómű megfelel a következő BMW 3-as széria xDrive, 4WD típusokhoz: E90 xDrive, E92 xDrive. A futóműszett rendelkezik Német nyelvű TÜV engedéllyel, ami szerint az ültetés mértéke elöl 15-45 mm, hátul 15-40 mm között állítható. Ezen felül lehetőség van további ültetésre elöl +35 mm, hátul +5 mm intervallumban. A futómű Made In Ap-Fahrwerke Németország gyártmány, és 2 év garanciával rendelkezik. Ne feledje, hogy a weboldal tartalmának és képeinek engedély nélküli másolása tilos!', 'AP made by KW Bmw E90, E92, csak xDrive, 2005.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e90-e92-csak-xdrive-2005-04-tol-allithato-magassagu-futomu'),
(464, '', '<div>\n<p>Az AP-Fahrwerke Állítható magasságú futómû olyan autótípushoz illeszkedik, mint a BMW 3-as széria, melynek Tipuskódja: E90, E92. Ez a Limousine típusú autókhoz, 2005.04-től gyártott modellekhez passzol. A tengelyterhelés elöl 1090 kg, míg hátul 1135 kg. Kivételt képeznek a négykerék-meghajtású modellek, és a gyári méretű gumi és felnikombináció esetén nyomtávszélesítő felszerelése szükséges.</p>\n\n<ul>\n	<li>A futómű Német nyelvű TÜV engedéllyel rendelkezik.</li>\n	<li>Az engedély által meghatározott ültetés mértéke elöl 30-60 mm, hátul szintén 30-60 mm között állítható (bár ennél nagyobb intervallumban is lehet állítani a futóművet, a TÜV engedély csak a fent említett beállításokra vonatkozik).</li>\n	<li>Lehetséges plusz ültetés: elöl +45 mm, hátul +5 mm.</li>\n</ul>\n\n<ul>\n	<li>Az AP-Fahrwerke termék Németországban készül.</li>\n	<li>Termékgarancia: 2 év.</li>\n</ul>\n\n<p><strong>Cikkszám: GF20-032</strong></p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Bmw E90, E92, 2005.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e90-e92-2005-04-tol-allithato-magassagu-futomu'),
(465, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a Bmw E90 Sedan modellekhez. Az 2005.11-től 2012.01-ig terjedő években gyártott autókhoz ajánlott szett 15 - 45 mm-es ültetést biztosít elöl és 15 - 40 mm-es ültetést hátul. Ez a futómű szett kifejezetten a Bmw E90 Sedan xDrive típusú autókhoz lett tervezve, maximális vezetési élményt biztosítva. A futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így garantálva a kiegyensúlyozott komfortot és dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>Ez a TÜV minősítéssel rendelkező termék a Vogtland nevű gyártó cég terméke, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén. Az ültetőrugókra és lengéscsillapítókra 2 éves garanciát vállalnak. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Bmw E90 xDrive, 2005.11-2012.01-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e90-xdrive-2005-11-2012-01-ig-allithato-magassagu-futomu'),
(466, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett célja a Bmw E92 Coupé modellek megjelenésének javítása és a vezetési élmény maximalizálása. A futómű lehetőséget nyújt az ültetés mértékének személyre szabott beállítására. A készlet magában foglalja a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n\n<p>Ez a TÜV minősítéssel ellátott termék olyan gyártótól származik, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén. A készlet 2 év garanciát nyújt az ültető rugókra és a lengéscsillapítókra. Alapvetően 4 db ültető rugó és 4 db lengéscsillapító található a szettben, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Bmw E92 xDrive, 2005.11-2012.01-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-e92-xdrive-2005-11-2012-01-ig-allithato-magassagu-futomu'),
(467, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett ideális választás a Bmw E91 Touring modellekhez. Ennek az innovatív kiegészítőnek az értékei közé tartozik az 2005.11-től gyártott autókhoz való alkalmazhatóság, valamint a 15 - 45 / 15 - 40 mm-es ülésmagasság-beállítási lehetőség. A Bmw E91 Touring xDrive típusra tervezett futómű szett maximális tengelyterhelése elöl 1090kg, míg hátul 1200 kg.</p> \n<p>Ez a minőségi futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanapság vezetési élményt is nyújt. Az egyedi beállítási lehetőségeknek köszönhetően személyre szabhatja az autó ülésmagasságát. A speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel vannak ellátva, garantálva a kiegyensúlyozott kényelmet és a dinamikus vezetést. Az első osztályú korrózióvédelemmel rendelkező lengéscsillapítók kiváló minőséget képviselnek.</p>\n<p>A termék büszkélkedhet TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát nyújt az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező- vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>', 'Vogtland Bmw E91 xDrive, 2005.11-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e91-xdrive-2005-11-tol-allithato-magassagu-futomu'),
(468, '', '<div><div><strong>Vogtland állítható magasságú sport futómű BMW E91 és E93 modellekhez</strong></div> <div> </div> <div>Az ültetés mértéke elöl: 30 - 60 mm</div> <div>Az ültetés mértéke hátul: 30 - 60 mm</div> <div> </div> <div>Az első tengely terhelése: maximum 1090 kg</div> <div>A hátsó tengely terhelése: maximum 1200 kg</div> <div> </div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div></div>', 'Vogtland Bmw E91, E93, kivéve 4WD, 2005.09-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e91-e93-kiveve-4wd-2005-09-tol-allithato-magassagu-futomu'),
(469, '', '<div>Az E90 BMW szedán Vogtland állítható magasságú sport futóművének ültetése elől és hátul 30-60 mm között változhat. Az első tengely terhelése 1090 kg alatt marad, míg a hátsó tengely terhelése 1135 kg alatt van. Fontos megjegyezni, hogy a termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Bmw E90 Sedan, 2005.04-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e90-sedan-2005-04-tol-allithato-magassagu-futomu'),
(470, '', '<div> <div> <p><strong>Vogtland</strong> futómű állítható magasságú szett: BMW 3-AS (E90/E91/E92/E93)</p>  <ul> 	<li><strong>Évjárat</strong>: 2006.09-től</li> 	<li><strong>Ültetés mértéke</strong>: 20 - 50 / 20 - 50 mm</li> 	<li><strong>Típus</strong>: BMW 3 E92, Typ 392C, Coupé, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1090 kg</li> 	<li><strong>Max. tengelyterhelés háton</strong>: 1135 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW200GF32_1470-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW200GF32_1470-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett a Vogtland futómű szett maximális vezetési élményt nyújt. A beállítási lehetőségeknek köszönhetően az ültetés magasságát az egyéni igények szerint állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók első osztályú korrózióvédelmet biztosítanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968398</p> </div> </div>', 'Vogtland Bmw E92, kivéve 4WD, 2006.09-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-e92-kiveve-4wd-2006-09-tol-allithato-magassagu-futomu'),
(471, '', '<p>Ez az állítható magasságú AP-Fahrwerke futóművet használhatod a következő autótípushoz:</p>\n\n<ul>\n	<li>BMW 3-as széria xDrive, 4WD, Touring</li>\n	<li>Tipuskód: E91</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2005.11-től</li>\n	<li>Tengelyterhelés elöl (kg): 1090</li>\n	<li>Tengelyterhelés hátul (kg): 1200</li>\n	<li>Egyéb kitételek: A gyári méretű gumi és felnikombináció esetén nyomtávszélesítő szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futómű Németországban készült, és Német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 15-45 mm, hátul: 15-40 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +35 mm, hátul: +5 mm</li>\n</ul>\n\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>\n\n<p><strong>Cikkszáma: </strong>11520049</p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Bmw E91 Touring, 320d xDrive, 325i xDrive, 330i xDrive, 330d xDrive, 335i xDrive, 2005.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-e91-touring-320d-xdrive-325i-xdrive-330i-xdrive-330d-xdrive-335i-xdrive-2005-11-tol-allithato-magassagu-futomu'),
(472, '', '<p>Egy állítható magasságú sport futómű, melyet a BMW F06 típusú autókhoz terveztek.</p>\\r\\n\\r\\n<p>Ennek a futóműnek az évjárata 2012.05-től kezdődik, kivéve az xDrive és az elektronikus futómű szabályzással szerelt modelleknél.</p>\\r\\n\\r\\n<p>A termék Made in Germany, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalálhat.</p>\\r\\n\\r\\n<p>Emellett 2 év teljeskörű garanciával érkezik, és kiváló minőségű, elképesztően jó áron kapható.</p>\\r\\n\\r\\n<p>A futómű szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot a beállításhoz.</p>', 'Jom Bochum Bmw F01, kivéve xDrive és elektronikus futómű szabályzással szerelt, 2008.11-től állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f01-kiveve-xdrive-es-elektronikus-futomu-szabalyzassal-szerelt-2008-11-tol-allithato-magassagu-futomu'),
(473, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy tökéletesen beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombinálva maximális ültetést nyújtunk.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termék megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiemelkedő ár/érték arány</li>\\r\\n	<li>német minőségű termék</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F01, kivéve 760i és iX, 2008.10-2015.12-ig, (első tengely terhelés 1280kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f01-kiveve-760i-es-ix-2008-10-2015-12-ig-els-tengely-terheles-1280kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(474, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a BMW 7-es (F01) modellekhez. Az általuk biztosított ültetési lehetőségeknek köszönhetően nemcsak esztétikailag javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. Ezzel a kiváló minőségű futómű szettel személyre szabottan állíthatja az autó ülésmagasságát. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. Az alapcsomag 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak szerelve.</p> <p>Made in Germany!</p>', 'Vogtland Bmw F01, kivéve 760i és iX, 2008.10-2015.12-ig, (első tengely terhelés 1280kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f01-kiveve-760i-es-ix-2008-10-2015-12-ig-els-tengely-terheles-1280kg-alatt-allithato-magassagu-futomu'),
(475, '', '<p>Egyedi Bmw F06 sport futómű állítható magassággal</p>\n<p>Az F06 típuskódú futómű 2012.05-től elérhető</p>\n<p>Nem kompatibilis: xDrive és elektromos futómű vezérléssel</p>\n<p>Gyártási hely: NÉMETORSZÁG</p>\n<p>A futómű rendelkezik német TÜV engedéllyel, mely csomagoláson belül található</p>\n<p>2 ÉV TELJES GARANCIÁVAL!!!</p>\n<p>Kiemelkedő minőség és kedvező ár!</p>\n<p>A csomag tartalma: 4 lengéscsillapító, hozzá tartozó rugókkal és egy állítókulccsal</p>', 'Jom Bochum Bmw F06, kivéve xDrive és elektronikus futómű szabályzással szerelt, 2012.05-től állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f06-kiveve-xdrive-es-elektronikus-futomu-szabalyzassal-szerelt-2012-05-tol-allithato-magassagu-futomu'),
(476, '', '<strong>Állítható magasságú sport futómű a BMW F10-hez MTS-Technik márkától</strong></p>  <p>Az MTS-Technik állítható sport futóművei ideálisak azok számára, akik értékelik a kiváló minőséget és megfizethető árat! A futómű könnyedén állítható a változó útviszonyokhoz, biztosítva az autó optimális hasmagasságát. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Az alábbi modellekhez kompatibilis:</u></p>  <ul> 	<li>Bmw F10 Sedan, 520i / 523i / 528i / 530i / 535i / 550i / M5 / 518d / 520d / 525d / 530d / 535d</li> 	<li>Kivéve xDrive</li> 	<li>Elülső ültetés: 0-65mm</li> 	<li>Hátsó ültetés: 10-75mm</li> 	<li>Elülső tengely terhelés: 1280kg</li> 	<li>Hátsó tengely terhelés: 1435kg</li> </ul>  <p><u>Főbb jellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugók és lengéscsillapítók tökéletes együttműködése</li> 	<li>Plug & Play készlet, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw F06 Gran Coupé, kivéve iX, 2012.05-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f06-gran-coupe-kiveve-ix-2012-05-tol-street-series-allithato-magassagu-futomu'),
(477, '', '<div><span>Az Ap futómű olyan lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk maximális ültetéssel együtt.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést biztosít.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F06 Gran Coupé, kivéve iX, 2012.05-től, (első tengely terhelés 1210kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f06-gran-coupe-kiveve-ix-2012-05-tol-els-tengely-terheles-1210kg-alatt-allithato-magassagu-futomu'),
(478, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: BMW 6-OS (F06)</p>  <ul> 	<li><strong>Évjárat</strong>: 2012.05-től</li> 	<li><strong>Ültetés mértéke</strong>: 25 - 55 / 20 - 50 mm</li> 	<li><strong>Típus</strong>: BMW 6 F06, Typ 6C, Gran Coupé, 2WD</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1210 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1320 kg</li> </ul>  <p>Ezen kiegészítő nemcsak esztétikailag javítja az autó megjelenését, hanem emellett a vezetési élményt is fokozza. A beállítási lehetőségek segítségével személyre szabhatja az autó ültetését. A futómű kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek garantálják a kiegyensúlyozott komfortot és a dinamikus vezetési élményt. A lengéscsillapítók kiváló korrozív ellenállással rendelkeznek.</p>  <p>A termék megfelel a TÜV minősítésnek. A gyártó, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A csomag tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót alapértelmezetten, kivéve azoknál az autótípusoknál, melyek más típusú futóművel rendelkeznek.</p>  <p>Készült Németországban!</p> ', 'Vogtland Bmw F06 Gran Coupé, kivéve iX, 2012.05-től, (első tengely terhelés 1210kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f06-gran-coupe-kiveve-ix-2012-05-tol-els-tengely-terheles-1210kg-alatt-allithato-magassagu-futomu'),
(479, '', '<strong>Bmw F11 JOM sport futómű állítható magassággal</strong></p>\\r\\n\\r\\n<p>Ez a futómű kifejezetten a F11 Touring típusú BMW modellekhez lett tervezve, a gyártása pedig Németországban történt 2010. márciusától kezdődően.</p>\\r\\n\\r\\n<p>Fontos tudni, hogy ez a futómű nem kompatibilis az xDrive változattal.</p>\\r\\n\\r\\n<p>A termék rendelkezik német TÜV engedéllyel, melyet a csomagolásban megtalálhat.</p>\\r\\n\\r\\n<p>A vásárlástól számított 2 év teljes körű garanciát vállalunk, így biztos lehet benne, hogy kiváló minőségű terméket vásárol, ráadásul hihetetlenül jó áron! </p>', 'Jom Bochum Bmw F11 Touring, kivéve xDrive, 2010.03-tól állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f11-touring-kiveve-xdrive-2010-03-tol-allithato-magassagu-futomu'),
(480, '', '<p>Egy állítható magasságú sport futómű a BMW F10 JOM BLUE LINE-tól.</p> <p>Ez a futómű kifejezetten a F10 Sedan típusú autókhoz lett tervezve, gyártásának éve 2010-ben kezdődött.</p> <p>Fontos tudni, hogy az elektronikus lengéscsillapítóval felszerelt és az xDrive modellekhez nem kompatibilis.</p> <p>A futómű tengelyterhelése elöl 1280 kg, míg hátul 1450 kg.</p> <p>A termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, mely a csomagolás részét képezi.</p> <p>Emellett 2 év teljeskörű garanciával érkezik, biztosítva a vevőket a gyártási hibák ellen.</p> <p>A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot a könnyű beállításhoz.</p>', 'Jom Bochum Bmw F10 Sedan, kivéve elektronikus lengéscsillapító szabályzással szerelt és xDrive típusok, 2010.03-tól, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f10-sedan-kiveve-elektronikus-lengescsillapito-szabalyzassal-szerelt-es-xdrive-tipusok-2010-03-tol-blue-line-allithato-magassagu-futomu'),
(481, '', '<strong>Bmw F10 MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azoknak, akik számára fontos a minőség és az ár. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlyban vannak.</p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li>Bmw F10 Sedan, 520i / 523i / 528i / 530i / 535i / 550i / M5 / 518d / 520d / 525d / 530d / 535d</li> 	<li>Kivéve xDrive</li> 	<li>Elülső ültetés mértéke: 0-65mm</li> 	<li>Hátsó ültetés mértéke: 10-75mm</li> 	<li>Elülső tengely terhelés: 1280kg</li> 	<li>Hátsó tengely terhelés: 1435kg</li> </ul>  <p><u>Főbb jellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Extrém igénybevételre tervezve is magas hatékonyság</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, nem igényel felfüggesztésmódosítást</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw F10 Sedan, kivéve xDrive, 2009.01-2016.10-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f10-sedan-kiveve-xdrive-2009-01-2016-10-ig-street-series-allithato-magassagu-futomu'),
(482, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy pontosan beállítsa a kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével lehetőség van egyénileg beállítani a járműmagasságot a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság összehangolása optimális felépítést eredményez.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F10 Sedan, 2010.03-tól, (első tengely terhelés 1195kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f10-sedan-2010-03-tol-els-tengely-terheles-1195kg-alatt-allithato-magassagu-futomu'),
(483, '', '<p>A Vogtland által készített állítható magasságú futómű szett kompatibilis a BMW 5-ÖS (F10) modellekkel, melyek gyártása 2010. márciusától kezdődött. A futómű ültetési mértéke 25-55 mm-el elöl és 20-50 mm-el hátul állítható. Ez a kit csak speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett korrózióvédelemmel ellátott első osztályú lengéscsillapítókat tartalmaz. </p> \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugók gyártása terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. </p> \n<p>Made in Germany!</p>', 'Vogtland Bmw F10 Sedan, kivéve iX és elektronikusan lengéscsillapító szabályzás, 2010.03-tól, (első tengely terhelés 1195kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f10-sedan-kiveve-ix-es-elektronikusan-lengescsillapito-szabalyzas-2010-03-tol-els-tengely-terheles-1195kg-alatt-allithato-magassagu-futomu'),
(484, '', '<p>Egy állítható magasságú sport futómű, melyet a BMW F20 és F21 típusokhoz terveztek. Ez a futómű ideális választás az 2011-től gyártott modellekhez, kivéve az xDrive változatokat. A futómű előre 1090 kg, míg hátra 1230 kg terhelést képes elviselni. Gyártása Németországban történt, és rendelkezik német TÜV engedéllyel, melyet a csomagolásban találsz meg. Emellett 2 év teljes körű garanciát vállalunk rá. A szett tartalmaz 4 lengéscsillapítót rugókkal, valamint 1 állítókulcsot is, hogy könnyedén beállíthasd a futóművet.</p>', 'Jom Bochum Bmw F20, F21, 114, 116, 118, 120, 125, kivéve xDrive, 2011-től, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f20-f21-114-116-118-120-125-kiveve-xdrive-2011-tol-blue-line-allithato-magassagu-futomu'),
(485, '', '<strong>Sportos futómű BMW F30 Sedanhoz az MTS-Technik Street kínálatából</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei optimális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>A következő autótípusokhoz ajánlott:</u></p>  <ul> 	<li><strong>Bmw F30 Sedan, </strong>320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés: 30-60mm</li> 	<li>Hátsó ültetés: 35-65mm</li> 	<li>Elülső fő rugó erőssége: 30 - 40 N/mm</li> 	<li>Hátsó fő rugó erőssége: 53 - 84 N/mm</li> 	<li>Elülső tengely terhelés: 1001-1040kg</li> 	<li>Hátsó tengely terhelés: 1180kg</li> 	<li>Nem rendelkezik TÜV engedéllyel!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevételek esetén is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes együttműködése</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást a felfüggesztésben</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p> ', 'MTS-Technik by Nord Performance Bmw F20, F21, csak xDrive, 2011.07-től, (első tengely terhelés 1001-1040kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f20-f21-csak-xdrive-2011-07-tol-els-tengely-terheles-1001-1040kg-street-series-allithato-magassagu-futomu'),
(486, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>A futómű az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n	<li>Bmw F30 Sedan, 320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li>\n	<li>Ültetés mértéke elöl: 30-60mm</li>\n	<li>Ültetés mértéke hátul: 35-65mm</li>\n	<li>Rugó erősség (első, fő rugó): 30 - 40 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 53 - 84 N/mm</li>\n	<li>Első tengely terhelés: 1000kg</li>\n	<li>Hátsó tengely terhelés: 1180kg</li>\n	<li>TÜV engedéllyel NEM rendelkezik!</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach cég gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiváló hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw F20, F21, csak xDrive, 2011.07-től, (első tengely terhelés 1000kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f20-f21-csak-xdrive-2011-07-tol-els-tengely-terheles-1000kg-alatt-street-series-allithato-magassagu-futomu'),
(487, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás lehet azok számára, akik számára fontos az ár-érték arány és a minőség. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén igazíthatók az útviszonyokhoz. Az MTS-Technik futóművek kiváló összhangban vannak a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>A futómű rugóit az Eibach cég gyártja.</li> <li>A magasság széles skálán, általában 25 és 80 mm között állítható.</li> <li>Gáztöltésű lengéscsillapítók.</li> <li>Magas hatékonyság extrém terhelés esetén is.</li> <li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében, beleértve a sárga cink bevonatot és a fekete anodyzált alumínium alkatrészeket.</li> <li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li> <li>A készlet plug & play, nem igényel átalakítást az autó felfüggesztésén.</li> </ul>', 'MTS-Technik by Nord Performance Bmw F20, F21, kivéve ix és szintszabályzós, 2010.11-től, (első tengely terhelés 920kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f20-f21-kiveve-ix-es-szintszabalyzos-2010-11-tol-els-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(488, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  \n<p>A MTS-Technik állítható magasságú sport futóművei kiemelkedő választás a vásárlók számára, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik állítható futóműveiben a rugók és a lengéscsillapítók optimális egyensúlya van.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n<li>a futóművek rugóit az Eibach cég gyártja</li>  \n<li>a magasság széles tartományban, legtöbb esetben 25 és 80 mm között állítható</li>  \n<li>gáztöltésű lengéscsillapítók</li>  \n<li>kiemelkedő hatékonyság extrém igénybevétel esetén is</li>  \n<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>  \n<li>ideális rugó és lengéscsillapító együttműködés</li>  \n<li>a készlet könnyen telepíthető, nem szükséges módosítás az autó felfüggesztésén</li>  \n</ul>', 'MTS-Technik by Nord Performance Bmw F20, F21, kivéve ix és szintszabályzós, 2010.11-től, (első tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f20-f21-kiveve-ix-es-szintszabalyzos-2010-11-tol-els-tengely-terheles-921-1090kg-allithato-magassagu-futomu'),
(489, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be az általuk kívánt ültetést. A sportos irányíthatóságot és az optimális vezetési magatartást kombináljuk a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyensúlyban van az optimális felépítés érdekében.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kivételes ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F20, F21, M135i xDrive, M140i xDrive, kivéve elektronikus futóműszabályzás, 2012.09-től, (első tengely terhelés 1001-1040kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f20-f21-m135i-xdrive-m140i-xdrive-kiveve-elektronikus-futomuszabalyzas-2012-09-tol-els-tengely-terheles-1001-1040kg-allithato-magassagu-futomu'),
(490, '', '<div><span>Az Ap futómű olyan lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy pontosan beállítsák a kívánt ültetést. A sportos irányíthatóságot és az optimális vezetési magatartást egyaránt biztosítjuk, miközben maximalizáljuk az ültetési lehetőségeket.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével az autó magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság összehangolása révén optimális felépítést érhetünk el.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F20, F21, kivéve 4WD és elektronikus futóműszabályzás, 2011.09-től, (tengely terhelés: 920/1230kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f20-f21-kiveve-4wd-es-elektronikus-futomuszabalyzas-2011-09-tol-tengely-terheles-9201230kg-allithato-magassagu-futomu'),
(491, '', '<div><span>Az Ap futómű célja, hogy a sportosan ambiciózus vezetők számára lehetővé tegye a milliméteres pontosságú ültetés beállítását. A sportos irányíthatóságot és optimális vezetési viselkedést kínáljuk a maximális ültetési lehetőségekkel együtt.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyban van az optimális konfiguráció érdekében.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termék megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás TÜV engedélyezett tartományban</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>páratlan ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F20, F21, kivéve 4WD és elektronikus futóműszabályzás, 2011.09-től, (tengely terhelés: 1090/1230kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f20-f21-kiveve-4wd-es-elektronikus-futomuszabalyzas-2011-09-tol-tengely-terheles-10901230kg-allithato-magassagu-futomu'),
(492, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 1-ES (F20 / F21)</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2011.09-től</li>\n	<li><strong>Ültetés mértéke</strong>: 30 - 55 / 25 - 50 mm</li>\n	<li><strong>Típus</strong>: BMW 1 F20/F21, Typ 1K2, 1K4, 2WD, 114i, 114d, 116i, 116d, 118i, 118d, 120d, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 920 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li>\n</ul>\n<p>Olyan módon fokozza az autó megjelenését és biztosítja a maximális vezetési élményt. Az ültetés mértékét az egyéni elképzeléseknek megfelelően állíthatja be. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiemelkedő korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely már több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezővel vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968710</p>', 'Vogtland Bmw F20, F21, kivéve 4WD és elektronikus futóműszabályzás, 2011.09-től, (első tengely terhelés: 920kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f20-f21-kiveve-4wd-es-elektronikus-futomuszabalyzas-2011-09-tol-els-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(493, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span> a BMW 1-ES (F20 / F21) modellekhez. Ez a futómû szett 2011 szeptemberétől alkalmazható, és lehetővé teszi az ültetés mértékének 30-55 mm-el való csökkentését elöl, illetve 25-50 mm-el hátul. Kompatibilis a BMW 1 F20/F21 típusokkal, kivéve azokat, amelyek elektronikus lengéscsillapítóval vagy összkerékhajtással rendelkeznek.</p> <p>Az ültetés mértékének beállítása mellett ez a futómű szett javítja az autó megjelenését, valamint optimális vezetési élményt biztosít. A kiváló minőségű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, ezáltal kiegyensúlyozott komfortot és fokozott dinamikát nyújtanak. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p> <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintező vagy torziós futómű van beépítve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968711</p>', 'Vogtland Bmw F20, F21, kivéve 4WD és elektronikus futóműszabályzás, 2011.09-től, (első tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f20-f21-kiveve-4wd-es-elektronikus-futomuszabalyzas-2011-09-tol-els-tengely-terheles-921-1090kg-allithato-magassagu-futomu'),
(494, '', '<p>A Vogtland által készített állítható magasságú futómű készlet megfelelő választás lehet a BMW 1-ES (F20 / F21) típusú autókhoz, melyek gyártási éve 2012. szeptembertől kezdődnek. Ez a készlet lehetővé teszi az ültetés mértékének szabályozását 30-55 mm között. A BMW 1 F20/F21 típusú autókhoz tervezett készlet kiváló vezetési élményt nyújt, miközben javítja az autó megjelenését. A futóműszett tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók elsőosztályú korrózióvédelemmel rendelkeznek.</p> <p>Fontos megjegyezni, hogy a termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A futóműkészlet általában 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p> <p>A termék \"Made in Germany\" minősítéssel rendelkezik, ami garancia a minőségre és a megbízhatóságra.</p>', 'Vogtland Bmw F20, F21, csak x-Drive, kivéve elektronikus futóműszabályzás, 2012.09-től, (első tengely terhelés 1001-1040kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f20-f21-csak-x-drive-kiveve-elektronikus-futomuszabalyzas-2012-09-tol-els-tengely-terheles-1001-1040kg-allithato-magassagu-futomu'),
(495, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a BMW 1-ES (F20/F21) modellekhez, évjáratától függetlenül. Ez a minőségi futómű rendszer lehetővé teszi az autó megjelenésének javítását, miközben optimális vezetési élményt nyújt. A futómű kitűnően beállítható, így személyre szabott ülésmagasságot érhet el. A szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus vezetést biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>\n<p>A termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak ellátva.</p>\n<p>Made in Germany!</p>', 'Vogtland Bmw F20, F21, csak x-Drive, kivéve elektronikus futóműszabályzás, 2012.09-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f20-f21-csak-x-drive-kiveve-elektronikus-futomuszabalyzas-2012-09-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(496, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás lehet a BMW 1-ES (F20 / F21) modellekhez, melyek gyártásának éve 2011.09-től kezdődött. Ez a kit lehetővé teszi az ültetés mértékének széles skálán történő beállítását, a legkisebb 30 mm-től egészen a legnagyobb 55 mm-ig elérhető tartományban. A BMW 1 F20/F21 típusokhoz tervezett szett kizárólag 2WD hajtáslánccal rendelkező modellekre alkalmazható, például 125i és 125d típusokra, kivéve a 4WD rendszert.</p>\n<p>Az autó megjelenésén javító Vogtland futómű nemcsak esztétikailag nyújt kiváló megjelenést, hanem maximális vezetési élményt is biztosít. Az ültetés mértékét könnyedén szabályozhatja az egyéni igények alapján, miközben a kiváló minőségű futómű szett magas teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, míg a termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett tartalmazza alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. Minden termék \"Made in Germany\" minőségi pecséttel rendelkezik.</p>\n<p>Cikkszám: 968194</p>', 'Vogtland Bmw F20, F21, csak elektronikus futóműszabályzás, kivéve 4WD, 2011.09-től, (első tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f20-f21-csak-elektronikus-futomuszabalyzas-kiveve-4wd-2011-09-tol-els-tengely-terheles-921-1090kg-allithato-magassagu-futomu'),
(497, '', '<p>A <strong>Vogtland</strong> állítható magasságú futómű szett az alábbi BMW 1-ES (F20 / F21) modellekhez alkalmazható:</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2011.09-től</li>\n	<li><strong>Ültetés mértéke</strong>: 30 - 55 / 25 - 50 mm</li>\n	<li><strong>Típus</strong>: BMW 1 F20/F21, Typ 1K2, 1K4, 2WD, 114i, 114d, 116i, 116d, 118i, 118d, 120d, kivéve 4WD</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 920 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li>\n	<li>Elektronikusan szabályozható futóművel szerelt típusokhoz <strong>(kiiktatás szükséges, a deaktiváló szettet a csomag tartalmazza!)</strong></li>\n</ul>\n<p>A termék nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt biztosít. Az ültetés mértékét szabadon állíthatja az egyéni igényeknek megfelelően. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968193</p>', 'Vogtland Bmw F20, F21, csak elektronikus futóműszabályzás, kivéve 4WD, 2011.09-től, (első tengely terhelés: 920kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f20-f21-csak-elektronikus-futomuszabalyzas-kiveve-4wd-2011-09-tol-els-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(498, '', '<div><strong><span>Bmw F30, F31, F34, F35 Bilstein B14 állítható magasságú futómû</span></strong><br />\\r\\n<br />\\r\\n<span>A BILSTEIN által kifejlesztett egycsöves rendszer</span><br />\\r\\n<span>Ami rendelkezik az Upside-Down technológiával</span><br />\\r\\n<span>Valamint versenysportrugókkal, melyeket nagy szilárdságú anyagból gyártanak</span><br />\\r\\n<span>Ez a futómű állítható magasságot biztosít, ahol a rugótányér és a kontra anya alumíniumból készül</span><br />\\r\\n<span>A B14 futóművet a BILSTEIN mérnökei úgy tervezték, hogy versenysport technológiát hozzanak az utcai autózásba. A B14-gyel a jármű magassága az első és hátsó tengelynél akár 50 mm-rel csökkenthető egy 20mm-es állítási tartományon belül. Az extrém terhelhetőségre tervezett egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</span></div>\\r\\n', 'Bilstein Bmw F20, F21, kivéve xDrive, 2011.11-től, Bilstein B14 állítható magasságú sport futómű állítható magasságú futómű', '', '', '', 'bilstein-bmw-f20-f21-kiveve-xdrive-2011-11-tol-bilstein-b14-allithato-magassagu-sport-futomu-allithato-magassagu-futomu'),
(499, '', '<strong>Bmw F30 Sedan MTS-Technik Street állítható magasságú sport futómû Motorsport toronycsapágyakkal</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművek kiváló választás azoknak, akik kiemelten fontosnak tartják a minőséget és az ár-érték arányt. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p> <p><u>A futómű a következő típusokhoz ajánlott:</u></p> <ul> <li><strong>Bmw F30 Sedan,</strong> 320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> <li>Elülső ültetés: 30-60mm</li> <li>Hátsó ültetés: 35-65mm</li> <li>Első fő rugó erőssége: 30 - 40 N/mm</li> <li>Hátsó fő rugó erőssége: 53 - 84 N/mm</li> <li>Elülső tengely terhelés: 1001-1040kg</li> <li>Hátsó tengely terhelés: 1180kg</li> <li>Nem rendelkezik TÜV engedéllyel!</li> </ul> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> <li>A magasság legtöbb esetben 25 és 80 mm között szabadon állítható</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Extrém igénybevételek mellett is magas hatékonyság</li> <li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> <li>Rugó és lengéscsillapító tökéletes együttműködése</li> <li>Plug & play kialakítás, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><u><strong>Termék jellemzők:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p> <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw F22, F87, csak xDrive, 2012.10-től, (első tengely terhelés 1001-1040kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f22-f87-csak-xdrive-2012-10-tol-els-tengely-terheles-1001-1040kg-street-series-allithato-magassagu-futomu'),
(500, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek kiváló választás azoknak, akik minőségi terméket szeretnének megfizethető áron. A futómű könnyedén beállítható a változó útviszonyoknak köszönhetően, így biztosítva az optimális teljesítményt. Az MTS-Technik futóművei a rugók és a lengéscsillapítók tökéletes összhangját biztosítják.</p>  <p><u>A következő autótípusokhoz megfelelő:</u></p>  <ul> 	<li><strong>Bmw F30 Sedan, </strong>320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés: 30-60mm</li> 	<li>Hátsó ültetés: 35-65mm</li> 	<li>Első rugó erősség: 30 - 40 N/mm</li> 	<li>Hátsó rugó erősség: 53 - 84 N/mm</li> 	<li>Elülső tengely terhelés: 1000kg</li> 	<li>Hátsó tengely terhelés: 1180kg</li> 	<li>Nincs TÜV engedély!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>A magasság 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszantartó korrózió ellen (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & Play készlet, nem igényel módosítást a felfüggesztésben</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw F32 Coupé, csak xDrive, 2013.07-től, (első tengely terhelés 1000kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f32-coupe-csak-xdrive-2013-07-tol-els-tengely-terheles-1000kg-alatt-street-series-allithato-magassagu-futomu'),
(501, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen szabályozható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlya van.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>a magasság szabadon szabályozható általában 25 és 80 mm között</li>  \n	<li>gáztöltésű lengéscsillapítók</li>  \n	<li>kiemelkedő hatékonyság extrém terhelés esetén is</li>  \n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Bmw F22, kivéve iX és szintszabályzós, 2012.10-től, (első tengely terhelés 920kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f22-kiveve-ix-es-szintszabalyzos-2012-10-tol-els-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(502, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság könnyedén és fokozatmentesen állítható az útviszonyoknak megfelelően. A futóművekben optimális egyensúly van a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach vállalat gyártja.</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés esetén is.</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangja.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw F22, kivéve iX és szintszabályzós, 2012.10-től, (első tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f22-kiveve-ix-es-szintszabalyzos-2012-10-tol-els-tengely-terheles-921-1090kg-allithato-magassagu-futomu'),
(503, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kombináljuk a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>A járműmagasság beállítására alumínium rugótányér segítségével van lehetőség a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság összehangolása optimális felhasználói élményt nyújt.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Kiemelkedő minőség versenyképes áron</li>\\r\\n	<li>Egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>Magas minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>Kivételes ár-érték arány</li>\\r\\n	<li>Német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F22, 228i xDrive, 230i xDrive, M235i xDrive, M240i xDrive, beleértve Adaptív futóművel, 2012.10-től, (első tengely terhelés 1006-1090kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f22-228i-xdrive-230i-xdrive-m235i-xdrive-m240i-xdrive-beleertve-adaptiv-futomuvel-2012-10-tol-els-tengely-terheles-1006-1090kg-allithato-magassagu-futomu'),
(504, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 2-ES (F22)</p>\n<ul>\n	<li><strong>Évjárat</strong>: Az autó 2011 szeptemberétől gyártható</li>\n	<li><strong>Ültetés mértéke</strong>: A futómű szett lehetővé teszi az ültetés mértékének változtatását 30-55 mm-el elöl és 25-50 mm-el hátul</li>\n	<li><strong>Típus</strong>: Kompatibilis BMW 2 F22 modellekkel, Typ 1C, 2WD meghajtással, kivéve azokat, amelyeknél elektronikus lengéscsillapító van, valamint 4WD modelleknél</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: Az elülső tengely maximális terhelése 920 kg lehet</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: A hátsó tengely maximális terhelése 1230 kg lehet</li>\n</ul>\n<p>A Vogtland állítható magasságú futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt nyújt. A megfelelő beállításokkal személyre szabhatja az autó ültetését. Ennek a minőségi futómű szetnek a részei kétcsöves lengéscsillapítók, melyek alacsony nyomású gázrendszere kiegyensúlyozott komfortot és dinamikát biztosít. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>Ez a termék TÜV minősítéssel rendelkezik. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát biztosít az ültetőrugókra és a lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968195</p>', 'Vogtland Bmw F22 Coupé, kivéve 4WD és elektronikus futóműszabályzás, 2014.02-től, (tengely terhelés 920kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f22-coupe-kiveve-4wd-es-elektronikus-futomuszabalyzas-2014-02-tol-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(505, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a BMW 1-ES (F20 / F21) típusú gépjárművek számára, melyek gyártási éve 2012 szeptembere utánra tehetők. Ezt a futóművet a kiváló minőség és a maximális vezetési élmény jellemzi. Az ültetés mértéke szabadon állítható 30-55 mm között, így mindenki saját igényeinek megfelelően alakíthatja autója megjelenését.</p>\n\n<p>Ez a speciális futómű szett kizárólag magas teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett kiváló korrózióvédelemmel rendelkeznek, így hosszú távon is megőrzik minőségüket.</p>\n\n<p>Fontos kiemelni, hogy a termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak. Minden darab \"Made in Germany\" minőséget képvisel.</p>', 'Vogtland Bmw F22 Coupé M235i x-Drive, kivéve elektronikus lengéscsillapító szabályzás, 2015.01-től, (első tengely terhelés 1005kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f22-coupe-m235i-x-drive-kiveve-elektronikus-lengescsillapito-szabalyzas-2015-01-tol-els-tengely-terheles-1005kg-alatt-allithato-magassagu-futomu'),
(506, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás lehet a BMW 1-es (F20 / F21) modellekhez. Ez a minőségi készlet lehetővé teszi az autó megjelenésének javítását és egy optimális vezetési élmény biztosítását. Az ültetés mértékét könnyedén beállíthatja a saját igényei szerint a megfelelő értékek között.</p>\n\n<p>A futómű kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó optimális teljesítményéhez.</p>\n\n<p>Fontos megjegyezni, hogy ez a termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Bmw F22 Coupé M235i x-Drive, kivéve elektronikus lengéscsillapító szabályzás, 2015.01-től, (első tengely terhelés 1006-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f22-coupe-m235i-x-drive-kiveve-elektronikus-lengescsillapito-szabalyzas-2015-01-tol-els-tengely-terheles-1006-1090kg-allithato-magassagu-futomu'),
(507, '', '<strong>Vogtland</strong> állítható magasságú futómű szett BMW 2-ES (F22) típushoz</p>  <ul> 	<li><strong>Évjárat</strong>: 2011.09-től</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: BMW 2 F22, Typ 1C, beleértve M235i, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1090 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1230 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt kínál. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. Ez a futómű szett kizárólag kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968196</p> ', 'Vogtland Bmw F22 Coupé, beleértve M235i, kivéve 4WD és elektronikus futóműszabályzással szerelt típusokhoz 2014.02-től, (tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f22-coupe-beleertve-m235i-kiveve-4wd-es-elektronikus-futomuszabalyzassal-szerelt-tipusokhoz-2014-02-tol-tengely-terheles-921-1090kg-allithato-magassagu-futomu'),
(508, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás lehet a BMW 2-ES (F22) típushoz, beleértve a M235i-t és a 2WD változatokat is. Ez a minőségi futómű kiválóan javítja az autó megjelenését, miközben optimális vezetési élményt nyújt. Az ültetés mértéke szabadon állítható a 30-55 mm-es tartományban, így mindenki saját ízlése szerint alakíthatja autója megjelenését.</p>\n<p>A futómű elektronikusan szabályozható típusokhoz is használható, azonban ezeknél a modelleknél a deaktiváló szett használata szükséges. A csomag tartalmazza ezt a kiegészítőt. A futómű maximális tengelyterhelése elől 1090 kg, míg hátul 1230 kg.</p>\n<p>Ez a Vogtland futóműszett exkluzív kétcsöves lengéscsillapítókkal van felszerelve, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus vezetési élményt biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, és első osztályú minőséget képviselnek.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>A termék \"Made in Germany\" minőséget garantál, cikkszáma: 968198.</p>', 'Vogtland Bmw F22 Coupé, beleértve M235i, csak elektronikus futóműszabályzással szerelt típusokhoz, kivéve 4WD, 2014.02-től, (tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f22-coupe-beleertve-m235i-csak-elektronikus-futomuszabalyzassal-szerelt-tipusokhoz-kiveve-4wd-2014-02-tol-tengely-terheles-921-1090kg-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(509, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás lehet a BMW 2-ES (F22) típusú autóhoz, melynek gyártási éve 2011-től kezdődik. Ennek a futóműnek az ültetés mértéke 30-55 mm elöl és 25-50 mm hátul, megfelelően beállítható az egyedi igények szerint. A BMW 2 F22, Typ 1C, 2WD típusú autókhoz, melyek elektronikusan szabályozható futóművel vannak ellátva, szükséges lehet a deaktiváló szett használata.</p>  \n<p>Ez a minőségi futómű szett kizárólag kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiváló kényelmet és dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú, hosszú távú használatra tervezve.</p>  \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugókészítés terén, 2 év garanciát nyújt az ültető rugókra és a lengéscsillapítókra.</p>  \n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>  \n<p>Gyártási hely: Németország!</p>  \n<p>Cikkszám: 968197</p>  ', 'Vogtland Bmw F22 Coupé, csak elektronikus futóműszabályzással szerelt típusokhoz, kivéve 4WD, 2014.02-től, (tengely terhelés 920kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f22-coupe-csak-elektronikus-futomuszabalyzassal-szerelt-tipusokhoz-kiveve-4wd-2014-02-tol-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(510, '', '<strong>Bmw M4 BILSTEIN B16 PSS10 állítható magasságú és keménységű futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>BILSTEIN egycsöves rendszerrel</li>\\r\\n	<li>BILSTEIN gáztöltéses technológiával</li>\\r\\n	<li>Egyszerű csillapítási erő beállításával</li>\\r\\n	<li>Triple-C-Technology felületkezeléssel a hosszú távú korrózióvédelem érdekében</li>\\r\\n	<li>Tetejéről lefelé szerelhető technológiával</li>\\r\\n	<li>Versenysportrugókból készült, nagy szilárdságú anyagból</li>\\r\\n	<li>Állítható magassággal (alumínium rugótányér és kontra anya segítségével)</li>\\r\\n	<li>Húzó és nyomófokozat egyidejűleg 9 fokozatban beállítható</li>\\r\\n	<li>TÜV minősítéssel rendelkezik</li>\\r\\n</ul>\\r\\n\\r\\n<p>Ez a futómű egy teljesítménykategóriát képvisel, amelyet a BILSTEIN mérnökei alkottak meg! A B16 PSS9-es lengéscsillapítóhoz képest ennek a futóműnek a jármű magassága az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Beépített állapotban a 9 karakterisztika beállítható egy beállító kerék segítségével, így biztosítva a jármű professzionális beállítását minden helyzetben.</p>\\r\\n', 'Bilstein Bmw F22 M2, M2 Competition, M2 CS, kivéve elektronikus lengéscsillapító szabályzás, 2015.11-től, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-bmw-f22-m2-m2-competition-m2-cs-kiveve-elektronikus-lengescsillapito-szabalyzas-2015-11-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(511, '', '<strong>Bmw F30, F31 JOM BLUE LINE állítható magasságú sport futómű</strong></p>  <p>Az alábbi futóművet tervezték a F30 Sedan és F31 Touring típusokhoz, 2012-től</p>  <p>Nem alkalmazható szintszabályzós és xDrive modelleknél</p>  <p>Tengelyterhelés elöl: 1090kg</p>  <p>Tengelyterhelés hátul: 1230 kg</p>  <p>GYÁRTVA NÉMETORSZÁGBAN</p>  <p>Ez a futómű rendelkezik megfelelő TÜV engedéllyel, melyet a csomagban megtalál.</p>  <p>2 éves teljeskörű garanciával!</p>  <p>Kiemelkedő minőség és fantasztikus ár-érték arány!</p>  <p>A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 kulcsot az állításhoz</p>', 'Jom Bochum Bmw F30, F31, 316, 318, 320, 328, 330, kivéve xDrive, 2012-től, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f30-f31-316-318-320-328-330-kiveve-xdrive-2012-tol-blue-line-allithato-magassagu-futomu'),
(512, '', '<p>Az MTS-Technik állítható magasságú sport futóművek kiváló választás azoknak, akik számára fontos a minőség és az ár-érték arány. A futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóművek rugói és lengéscsillapítói között optimális egyensúly van. </p> <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Bmw F31 Touring, </strong>320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés mértéke: 30-60mm</li> 	<li>Hátsó ültetés mértéke: 40-65mm</li> 	<li>Elülső fő rugó erőssége: 30 - 40 N/mm</li> 	<li>Hátsó fő rugó erőssége: 100 N/mm</li> 	<li>Elülső tengely terhelés: 1001-1040kg</li> 	<li>Hátsó tengely terhelés: 1310kg</li> 	<li>Nincs TÜV engedély!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p> ', 'MTS-Technik by Nord Performance Bmw F31 Touring, csak xDrive, 2012.07-2019.06-ig, (első tengely terhelés 1001-1040kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f31-touring-csak-xdrive-2012-07-2019-06-ig-els-tengely-terheles-1001-1040kg-street-series-allithato-magassagu-futomu'),
(513, '', '<strong>Az MTS-Technik Street állítható magasságú sport futómű tökéletes választás azoknak, akik az autójuk teljesítményére és kényelmére is odafigyelnek!</strong></p>  <p>Az MTS-Technik sport futóművei lehetővé teszik az autó hasmagasságának fokozatmentes beállítását az útviszonyoknak megfelelően. A rugók és lengéscsillapítók optimális egyensúlya biztosítja a kiváló teljesítményt.</p>  <p><u>A futómű az alábbi típusokhoz passzol:</u></p>  <ul> 	<li><strong>Bmw F31 Touring, </strong>320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés: 30-60mm</li> 	<li>Hátsó ültetés: 40-65mm</li> 	<li>Elülső rugó erősség: 30 - 40 N/mm</li> 	<li>Hátsó rugó erősség: 100 N/mm</li> 	<li>Elülső tengely terhelés: 1000kg</li> 	<li>Hátsó tengely terhelés: 1310kg</li> 	<li>Nincs TÜV engedély!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat hosszú távú korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, nem igényel módosítást</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának, képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw F31 Touring, csak xDrive, 2012.07-2019.06-ig, (első tengely terhelés 1000kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f31-touring-csak-xdrive-2012-07-2019-06-ig-els-tengely-terheles-1000kg-alatt-street-series-allithato-magassagu-futomu'),
(514, '', '<p>Az MTS-Technik állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>a futóművek rugóit az Eibach cég gyártja</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém igénybevételek mellett is</li> <li>két rétegű bevonattal a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> <li>tökéletes összhang a rugók és a lengéscsillapítók között</li> <li>a készlet plug & play, nem igényel autó felfüggesztésében való módosítást</li> </ul>', 'MTS-Technik by Nord Performance Bmw F30 Sedan, kivéve iX és szintszabályzós, 2011.03-tól, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f30-sedan-kiveve-ix-es-szintszabalyzos-2011-03-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(515, '', '<strong>Bmw F30 Sedan MTS-Technik Street állítható magasságú sport futómû Motorsport toronycsapágyakkal</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár! A magasság folyamatosan állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók tökéletes összhangban vannak. </p>  <p><u>Az alábbi típusokhoz megfelelő:</u></p>  <ul> 	<li><strong>Bmw F30 Sedan, </strong>320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés: 30-60mm</li> 	<li>Hátsó ültetés: 35-65mm</li> 	<li>Első rugó erőssége: 30 - 40 N/mm</li> 	<li>Hátsó rugó erőssége: 53 - 84 N/mm</li> 	<li>Elülső tengely terhelése: 1000kg</li> 	<li>Hátsó tengely terhelése: 1180kg</li> 	<li>Nem rendelkezik TÜV engedéllyel!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Bmw F30 Sedan, csak xDrive, 2011.11-2018.10-ig, (első tengely terhelés 1000kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f30-sedan-csak-xdrive-2011-11-2018-10-ig-els-tengely-terheles-1000kg-alatt-street-series-allithato-magassagu-futomu'),
(516, '', '<strong>Bmw F30 Sedan MTS-Technik Street - Rugós és lengéscsillapítós futómű</strong></p>  <p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A futómű könnyedén állítható a útviszonyoknak megfelelően, így biztosítva az autó optimális hasmagasságát. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók tökéletes egyensúlyban vannak.</p>  <p><u>A futómű a következő típusokhoz alkalmas:</u></p>  <ul> 	<li><strong>Bmw F30 Sedan, </strong>320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés: 30-60mm</li> 	<li>Hátsó ültetés: 35-65mm</li> 	<li>Elülső fő rugó erősség: 30 - 40 N/mm</li> 	<li>Hátsó fő rugó erősség: 53 - 84 N/mm</li> 	<li>Elülső tengely terhelés: 1001-1040kg</li> 	<li>Hátsó tengely terhelés: 1180kg</li> 	<li>Nem rendelkezik TÜV engedéllyel!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugós futóművekhez az <strong>Eibach</strong> gyártja a rugókat</li> 	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet egyszerűen telepíthető, nem igényel autófelfüggesztés módosítást</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw F30 Sedan, csak xDrive, 2011.11-2018.10-ig, (első tengely terhelés 1001-1040kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f30-sedan-csak-xdrive-2011-11-2018-10-ig-els-tengely-terheles-1001-1040kg-street-series-allithato-magassagu-futomu'),
(517, '', '<p>Az MTS-Technik által készített sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az versenyképes ár. A futómű magassága fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. A rugók a híres Eibach vállalat gyártásában készülnek, míg a magasság skálája általában 25 és 80 mm között állítható. A lengéscsillapítók gáztöltésűek, és rendkívüli hatékonyságot nyújtanak extrém körülmények között is. A futóművek kettős bevonattal rendelkeznek a hosszú távú korrózióvédelem érdekében: sárga cinkbevonat és fekete anodizált alumínium alkatrészek. Az MTS-Technik futóművei tökéletes összhangban vannak rugóik és lengéscsillapítóik között, és a készlet plug & play megoldást kínál, nem igényel módosítást az autó felfüggesztésében.</p>', 'MTS-Technik by Nord Performance Bmw F34 Gran Turismo, kivéve iX és szintszabályzós, 2012.07-től, (első tengely terhelés 951-1015kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f34-gran-turismo-kiveve-ix-es-szintszabalyzos-2012-07-tol-els-tengely-terheles-951-1015kg-allithato-magassagu-futomu'),
(518, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár. A futómű magassága folyamatosan állítható, így könnyedén beállítható az autó alvázának magassága az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach cég gyártja</li> 	<li>A magasság széles határok között állítható, általában 25 és 80 mm között</li> 	<li>Gáztöltetű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Bmw F34 Gran Turismo, kivéve iX és szintszabályzós, 2012.07-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f34-gran-turismo-kiveve-ix-es-szintszabalyzos-2012-07-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(519, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiváló egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>a futóművek rugóit az Eibach gyártja</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém terhelés mellett is</li> <li>két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében</li> <li>ideális egyensúly a rugók és a lengéscsillapítók között</li> <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Bmw F30 Sedan, kivéve iX és szintszabályzós, 2011.03-tól, (első tengely terhelés 951-1090kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f30-sedan-kiveve-ix-es-szintszabalyzos-2011-03-tol-els-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(520, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár! Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően, mivel fokozatmentesen állítható magassággal rendelkeznek. Az MTS-Technik állítható futóművei kiváló összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság széles tartományban, általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet könnyen beszerelhető, nem igényel módosítást az autó felfüggesztésében</li> </ul> ', 'MTS-Technik by Nord Performance Bmw F31 Touring, kivéve iX és szintszabályzós, 2011.03-tól, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f31-touring-kiveve-ix-es-szintszabalyzos-2011-03-tol-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(521, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A magasság könnyen beállítható a különböző útviszonyokhoz igazodva, így biztosítva az autó optimális hasmagasságát. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók között tökéletes egyensúly van.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja.</li>\n	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw F31 Touring, kivéve iX és szintszabályzós, 2011.03-tól, (első tengely terhelés 966-1020kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f31-touring-kiveve-ix-es-szintszabalyzos-2011-03-tol-els-tengely-terheles-966-1020kg-allithato-magassagu-futomu'),
(522, '', '<strong>Testreszabható V-Maxx futómű a BMW F31 kombihoz</strong><br />Az alábbi modellekhez: 316i, 318, 320i, 325i, 328i, 330i, 330E, 335i, 340i, 316D, 318D, 320D, 3250D, 330D<br />Kivétel: xDrive, légrugós futómű és M3 változatok<br />Gyártási év: 2011.10-től<br />Keménység 20 fokozatban állítható<br />Elülső ültetési tartomány: 40-75mm<br />Hátsó ültetési tartomány: 30-75mm<br />Fontos megjegyzés: A futómű beépítéséhez szükséges egy rövidített stabilizátorrúd<br />A termék rendelkezik TÜV minősítéssel!', 'V-Maxx Bmw F31 Touring, 316i, 318, 320i, 325i, 328i, 330i, 330E, 335i, 340i, 316D, 318D, 320D, 3250D, 330D, kivéve xDrive, szintszabályzós és M3, 2011.10-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f31-touring-316i-318-320i-325i-328i-330i-330e-335i-340i-316d-318d-320d-3250d-330d-kiveve-xdrive-szintszabalyzos-es-m3-2011-10-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(523, '', '<em>A Bmw F30-hoz elérhető V-Maxx futómű</em><br /><p>A fenti autótípusokhoz alkalmazható: 316i, 318, 320i, 325i, 328i, 330i, 330E, 335i, 340i, 316D, 318D, 320D, 3250D, 330D</p><br /><pNem támogatott: xDrive, léghuzattal és M3 verziók</p><br /><p>Gyártási év: 2011.10-től</p><br /><p>Keménység 20 fokozatban állítható!</p><br /><p>Elülső ültetési tartomány: 40-75mm</p><br /><p>Hátsó ültetési tartomány: 30-75mm</p><br /><p>Fontos! A futómű beépítéséhez szükséges a stabilizátor rúd rövidítése!</p><br /><p>A futómű TÜV minősítéssel rendelkezik!</p>', 'V-Maxx Bmw F30, 316i, 318, 320i, 325i, 328i, 330i, 330E, 335i, 340i, 316D, 318D, 320D, 3250D, 330D, kivéve xDrive, szintszabályzós és M3, 2011.10-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f30-316i-318-320i-325i-328i-330i-330e-335i-340i-316d-318d-320d-3250d-330d-kiveve-xdrive-szintszabalyzos-es-m3-2011-10-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(524, '', '<strong>Bmw F34 Gran Turismo V-Maxx állítható magasságú és rugalmas futómű</strong><br />Az alábbi típusokhoz: 320i, 325i, 328i, 330i, 330E, 335i, 340i, 318D, 320D, 3250D, 330D<br />Kivéve: xDrive, léghengergyártós és M3 modellek<br />Gyártási év: 2013.03-tól<br />A futómű 20 fokozatban szabályozható rugalmasságot biztosít!<br />Az elülső ültetés tartománya: 40-75mm<br />A hátsó ültetés tartománya: 30-75mm<br />Fontos megjegyzés: A futómű beépítéséhez rövidített stabilizátor rúdra van szükség!<br />A termék rendelkezik TÜV minősítéssel!', 'V-Maxx Bmw F34 Gran Turismo, 320i, 325i, 328i, 330i, 330E, 335i, 340i, 318D, 320D, 3250D, 330D, kivéve xDrive, szintszabályzós és M3, 2013.03-tól, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f34-gran-turismo-320i-325i-328i-330i-330e-335i-340i-318d-320d-3250d-330d-kiveve-xdrive-szintszabalyzos-es-m3-2013-03-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(525, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy pontosan beállítsa a kívánt ültetést. Ennek eredményeként a sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>A járműmagasság egyénileg beállítható egy alumínium rugótányér segítségével a TÜV által engedélyezett tartományon belül. Ennek eredményeként a sportosság, kényelem és biztonság tökéletes egyensúlyban van.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány garantált</li>\\r\\n	<li>kivételes ár/érték arány</li>\\r\\n	<li>német precizitás és minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F30 Sedan, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2012.02-től, (első tengely terhelés 951-1090kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f30-sedan-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2012-02-tol-els-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(526, '', '<div><span>Az Ap futómű olyan lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás egyedülálló kombinációját nyújtjuk, maximalizálva ezzel az ültetés hatékonyságát.</span></div>\\r\\n\\r\\n<div>A járműmagasság egyedi beállítását egy alumínium rugótányér segítségével lehet elvégezni, amely a TÜV által engedélyezett tartományban történik. A sportosság, kényelem és biztonság összehangolása optimális felhasználói élményt nyújt.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Magas minőségű termék megfizethető áron</li>\\r\\n	<li>Egyéni járműmagasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány biztosítása</li>\\r\\n	<li>Egyedülálló ár-érték arány</li>\\r\\n	<li>Német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW  Bmw F30 Sedan, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2012.02-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw--bmw-f30-sedan-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2012-02-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(527, '', '<div><span>Az Ap futómű ideális választás a sportosan ambiciózus vezetők számára, akik pontosan be szeretnék állítani az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat ötvözzük a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes egyensúlyát teremtjük meg, így optimális felépítést biztosítva.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű alkatrészek elérhető áron</li>\\r\\n	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány garantálja a megbízhatóságot</li>\\r\\n	<li>egyedülálló ár-érték arány a piacon</li>\\r\\n	<li>német minőségű munka</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F31 Touring, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2012.08-tól, (első tengely terhelés 914-1020kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f31-touring-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2012-08-tol-els-tengely-terheles-914-1020kg-allithato-magassagu-futomu'),
(528, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, lehetővé téve számukra, hogy precízen beállítsák a kívánt ültetést. Egy olyan futóművet kínálunk, amely ötvözi a sportos irányíthatóságot és az optimális vezetési tulajdonságokat a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. Ennek eredményeként a sportosság, kényelem és biztonság tökéletes egyensúlyban lesznek, biztosítva az optimális teljesítményt.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termék megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiemelkedő ár/érték arány</li>\\r\\n	<li>német minőségű megoldás</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F34 GT, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2013.05-től, (első tengely terhelés 951-1015kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f34-gt-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2013-05-tol-els-tengely-terheles-951-1015kg-allithato-magassagu-futomu'),
(529, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetőknek arra, hogy a kívánt ültetést milliméterre pontosan beállítsák. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk, maximalizálva ezzel az ültetést.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével az autó magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, a kényelem és a biztonság harmonikus egyensúlyban van az optimális beállításnak köszönhetően.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>prémium minőség elérhető áron</li>\\r\\n	<li>egyedi magasságállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány garantált</li>\\r\\n	<li>kivételes ár-érték arány</li>\\r\\n	<li>német minőségű</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F34 GT, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2013.05-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f34-gt-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2013-05-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(530, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk, a maximális ültetéssel együtt.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, a kényelem és a biztonság összehangolása egy optimális felépítést eredményez.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li=egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F31 Touring, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2012.08-tól, (első tengely terhelés 913kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f31-touring-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2012-08-tol-els-tengely-terheles-913kg-alatt-allithato-magassagu-futomu'),
(531, '', '<p><strong>Bmw F34 GT Vogtland</strong><span> állítható magasságú futómű szett</span></p>\n<ul>\n    <li><strong>Évjárat</strong>: 2013.05-től</li>\n    <li><strong>Ültetés mértéke</strong>: 30 - 55 / 15 - 40 mm</li>\n    <li><strong>Típus</strong>: F34 GT 2WD, kivéve elektronikus lengéscsillapító</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 950 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1265 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt ez a futómű szett. A beállítható ültetés mértéke lehetővé teszi az egyéni igényeknek megfelelő beállítást. A magas teljesítményű két csöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a dinamikus vezetést. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező vagy torziós futóművet szereltek.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968249</p>', 'Vogtland Bmw F34 GT Sedan, kivéve 4WD és elektronikus futóműszabályzás, 2013.05-től, (tengely terhelés: 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f34-gt-sedan-kiveve-4wd-es-elektronikus-futomuszabalyzas-2013-05-tol-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(532, '', '<p><strong>Bmw F31 Vogtland</strong><span> állítható magasságú futómû szet</span></p> <ul>     <li><strong>Évjárat</strong>: 2012.08-tól</li>     <li><strong>Ültetés mértéke</strong>: 40 - 65 / 30 - 55 mm</li>     <li><strong>Típus</strong>: 320d, 325d, 328i, 330d, 335i, kivéve elektronikus lengéscsillapító, 4WD</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 1020 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1225 kg</li>     <li> </li> </ul> <p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. A beállított értékek segítségével személyre szabható az ültetés mértéke. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a kényelem és dinamika tökéletes egyensúlyához.</p> <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968715</p>', 'Vogtland Bmw F31 Touring, kivéve 4WD és elektronikus futóműszabályzás, 2012.08-tól, (tengely terhelés: 914-1020kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f31-touring-kiveve-4wd-es-elektronikus-futomuszabalyzas-2012-08-tol-tengely-terheles-914-1020kg-allithato-magassagu-futomu'),
(533, '', '<p><strong>Bmw F31 Vogtland</strong><span> állítható magasságú futómű szett</span></p>\n<ul>\n    <li><strong>Gyártási év</strong>: 2012.08-tól</li>\n    <li><strong>Lemélyítés mértéke</strong>: 40 - 65 / 30 - 55 mm</li>\n    <li><strong>Modellek</strong>: 316d, 316i, 318d, 320i, kivéve járművek elektronikus lengéscsillapítóval, összkerékhajtással</li>\n    <li><strong>Max. első tengelyterhelés</strong>: 913 kg</li>\n    <li><strong>Max. hátsó tengelyterhelés</strong>: 1225 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett optimális vezetési élményt nyújt. Az ültetés mértékét a felhasználó saját elképzeléseinek megfelelően állíthatja be. Ez a prémium minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, melynek több mint 100 éves tapasztalata van a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968714</p>', 'Vogtland Bmw F31 Touring, kivéve 4WD és elektronikus futóműszabályzás, 2012.08-tól, (tengely terhelés: 913kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f31-touring-kiveve-4wd-es-elektronikus-futomuszabalyzas-2012-08-tol-tengely-terheles-913kg-alatt-allithato-magassagu-futomu'),
(534, '', '<p>Egy állítható magasságú futómű szett a BMW F30 típushoz, melynek érvényességi ideje 2012. februárától kezdődik. A futómű leültetésének mértéke 25-55 mm elöl és 30-60 mm hátul. Ez a futóműszett kizárólag a BMW 3 F30 típushoz alkalmas, kivéve azokat a modelleket, melyek elektronikus lengéscsillapítóval vannak felszerelve. Az elülső tengely maximális terhelése 1001-1090 kg, míg a hátsó tengelyé 1180 kg.</p>  \n<p>Ez a futómű nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A beállítások lehetővé teszik az ültetés szintjének testreszabását az egyéni igények szerint. A futóműszett magas teljesítményű, kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják az egyensúlyt a komfort és a dinamika között. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  \n<p>Ez a termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek más típusú futóművel vannak felszerelve.</p>  \n<p>Készült Németországban!</p>', 'Vogtland Bmw F30 Sedan x-Drive, kivéve elektronikus futóműszabályzás, 2012.02-től, (első tengely terhelés 1001-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f30-sedan-x-drive-kiveve-elektronikus-futomuszabalyzas-2012-02-tol-els-tengely-terheles-1001-1090kg-allithato-magassagu-futomu'),
(535, '', '<p>Egy állítható magasságú futómű szett, melyet a BMW F30 típusú autókhoz terveztek a Vogtland vállalatnál. Ez a futómű kitűnő lehetőséget biztosít arra, hogy testre szabhassuk az autó megjelenését és vezetési élményét. A futómű ültetését egyéni elképzeléseink szerint állíthatjuk a megadott értékek között. A szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>', 'Vogtland Bmw F30 Sedan x-Drive, kivéve elektronikus futóműszabályzás, 2012.02-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f30-sedan-x-drive-kiveve-elektronikus-futomuszabalyzas-2012-02-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(536, '', '<p><strong>Bmw F30 Vogtland</strong><span> állítható magasságú futómû szett</span></p> <ul>     <li><strong>Évjárat</strong>: 2012.02-tõl</li>     <li><strong>Ültetés mértéke</strong>: 40 - 65 / 30 - 60 mm</li>     <li><strong>Típus</strong>: 330d, 335i, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 1090 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1160 kg</li>     <li> </li> </ul> <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. A felhasználó személyes igényei szerint állítható az ültetés mértéke. A speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968713</p>', 'Vogtland Bmw F30 Sedan, kivéve 4WD és elektronikus futóműszabályzás, 2013.02-től, (tengely terhelés: 951-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f30-sedan-kiveve-4wd-es-elektronikus-futomuszabalyzas-2013-02-tol-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(537, '', '<p><strong>Bmw F30 Vogtland</strong><span> állítható magasságú futómű szett</span></p> <ul>     <li><strong>Évjárat</strong>: 2012.02-től</li>     <li><strong>Ültetés mértéke</strong>: 40 - 65 / 30 - 60 mm</li>     <li><strong>Típus</strong>: 316d, 316i, 318d, 318i, 320d, 320i, 325d, 328i, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: 950 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li>     <li> </li> </ul> <p>Az autó megjelenésén javítva maximális vezetési élményt nyújt ez a futómű szett. A magasságot az egyéni igények szerint lehet beállítani. A speciális, nagy teljesítményű lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a dinamikus vezetést. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p> <p>A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968712</p>', 'Vogtland Bmw F30 Sedan, kivéve 4WD és elektronikus futóműszabályzás, 2013.02-től, (tengely terhelés: 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f30-sedan-kiveve-4wd-es-elektronikus-futomuszabalyzas-2013-02-tol-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(538, '', '<p><strong>Bmw F34 GT Vogtland</strong><span> állítható magasságú futómû szett</span></p>\n<ul>\n<li><strong>Évjárat</strong>: 1 May 2013-</li>\n<li><strong>Ültetés mértéke</strong>: 30 - 55 / 15 - 40 mm</li>\n<li><strong>Típus</strong>: F34 GT 2WD, kivéve elektronikus lengéscsillapító</li>\n<li><strong>Max. tengelyterhelés elõl</strong>: 1000 kg</li>\n<li><strong>Max. tengelyterhelés hátu</strong>l: 1265 kg</li>\n</ul>\n<p>Az autó megjelenését javító és maximalizáló vezetési élményt biztosító termék. Az ültetés mértékét a felhasználó igényei szerint állíthatja be. A futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, több mint 100 éves tapasztalattal a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968250</p>', 'Vogtland Bmw F34 GT Sedan, kivéve 4WD és elektronikus futóműszabályzás, 2013.05-től, (tengely terhelés: 951-1000kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f34-gt-sedan-kiveve-4wd-es-elektronikus-futomuszabalyzas-2013-05-tol-tengely-terheles-951-1000kg-allithato-magassagu-futomu'),
(539, '', '<p>A Vogtland állítható magasságú futómű szett megfelelő a 2012.02-től gyártott BMW 4-es típusú autókhoz, kifejezetten a BMW 4 F32 Coupé modellekhez. A futóművel szerelt típusokhoz szükséges a deaktiváló szett használata. Az ültetés mértéke 40-65 mm elöl és 30-60 mm hátul, a maximális tengelyterhelés pedig 951-1090 kg elöl és 1160 kg hátul. Ez a minőségi futómű szett kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel a kiegyensúlyozott komfortért és dinamikus vezetési élményért. A lengéscsillapítók első osztályú korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.</p>\n<p>Mindemellett, a Vogtland futóművek Made in Germany minőségű termékek.</p>\n<p>Cikkszám: 968254</p>', 'Vogtland Bmw F32 Coupé, csak elektronikus lengéscsillapító szabályzással, kivéve 4WD, 2012.02-től, (első tengely terhelés 951-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-csak-elektronikus-lengescsillapito-szabalyzassal-kiveve-4wd-2012-02-tol-els-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(540, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás lehet a BMW 4-ES (F32 / F33) modellekhez, amelyek gyártása 2012. februárától kezdődött. Ennek a kiváló minőségű futómű szettnek az ültetés mértéke 40-65 mm-el csökkenthető elöl és 30-60 mm-el hátul. Ez a készlet kifejezetten a BMW 4 F32, Typ 3C, Coupé, 2WD típusú járművekhez készült, amelyekhez elektronikusan szabályozható futóművel szereltek. Fontos megjegyezni, hogy az elektronikus szabályozás kiiktatása szükséges, de ehhez a csomag tartalmazza a megfelelő deaktiváló szettet.</p>\n<p>A Vogtland futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem a maximális vezetési élményt is biztosítja. A rugók és lengéscsillapítók minőségi anyagokból készültek, és a kettős csöves lengéscsillapítók alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és dinamikus vezetést biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A csomag alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező vagy torziós futóművek szükségesek.</p>\n<p>Ez a kiváló minőségű futómű szett Made in Germany!</p>\n<p>Cikkszám: 968253</p>', 'Vogtland Bmw F32 Coupé, csak elektronikus lengéscsillapító szabályzással, kivéve 4WD, 2012.02-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-csak-elektronikus-lengescsillapito-szabalyzassal-kiveve-4wd-2012-02-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(541, '', '<p>Az állítható magasságú JOM BLUE LINE sportfutómű megfelel a F32 típuskódnak és 2013-tól használható. Fontos tudni, hogy az elektronikus futómű szabályzással rendelkező típusok kivételét képezik. Elöl a tengelyterhelés 1090 kg, míg hátul 1230 kg lehet. Ezt a minőségi futóművet Németországban gyártják, és a csomagolás tartalmazza a német nyelvű TÜV engedélyt. A termékhez 2 év teljes körű garancia jár! Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot.</p>\n<p>A JOM BlueLine állítható magasságú sportfutóművek kiemelkedő minőséget képviselnek, melyek típusspecifikusak. Az autó magassága egy speciális állítókulcs segítségével könnyedén módosítható a kívánt tartományon belül. A futómű 19.3 TÜV minősítéssel rendelkezik, és EPS technológiával készült, porfestett és horganyzott alkatrészekkel.</p>', 'Jom Bochum Bmw F32 Coupé, 418, 420, 425, 428, 430, 435, kivéve elektronikus futómű szabályzással szerelt, 2013-tól, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-bmw-f32-coupe-418-420-425-428-430-435-kiveve-elektronikus-futomu-szabalyzassal-szerelt-2013-tol-blue-line-allithato-magassagu-futomu'),
(542, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveinél a rugók és a lengéscsillapítók optimális egyensúlya biztosított.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>a futóművek rugóit az Eibach gyártja</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>magas hatékonyság extrém terhelés mellett is</li> <li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> <li>tökéletes összhang a rugók és a lengéscsillapítók között</li> <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Bmw F32 Coupé, kivéve iX és szintszabályzós, 2013.07-től, (első tengely terhelés 951-1020kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f32-coupe-kiveve-ix-es-szintszabalyzos-2013-07-tol-els-tengely-terheles-951-1020kg-allithato-magassagu-futomu'),
(543, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek kiváló választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az kedvező ár-érték arányt. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók tökéletes egyensúlyát biztosítják.</p> <p><u>Főbb jellemzők:</u></p> <ul> <li>A futóművek rugóit az Eibach cég gyártja.</li> <li>A magasság széles tartományban, általában 25 és 80 mm között állítható.</li> <li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is.</li> <li>Két rétegű bevonat védi a futóművet hosszú távon a korróziótól (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li> <li>A futómű tökéletes összhangot teremt a rugók és a lengéscsillapítók között.</li> <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li> </ul>', 'MTS-Technik by Nord Performance Bmw F33 Cabrio, kivéve iX és szintszabályzós, 2013.10-től, (első tengely terhelés 960kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f33-cabrio-kiveve-ix-es-szintszabalyzos-2013-10-tol-els-tengely-terheles-960kg-alatt-allithato-magassagu-futomu'),
(544, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Bmw F33 Cabrio, kivéve iX és szintszabályzós, 2013.10-től, (első tengely terhelés 961-1025kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f33-cabrio-kiveve-ix-es-szintszabalyzos-2013-10-tol-els-tengely-terheles-961-1025kg-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(545, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik állítható sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság folyamatosan szabályozható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között. </p>  <p><u>Főbb jellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Kettős bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Bmw F32 Coupé, kivéve iX és szintszabályzós, 2013.07-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f32-coupe-kiveve-ix-es-szintszabalyzos-2013-07-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(546, '', '<strong>Állítható magasságú sport futómű BMW F30 Sedan MTS-Technik Street kivitelben</strong></p>  <p>Az MTS-Technik sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futómű magassága fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és lengéscsillapítók optimális egyensúlya biztosított.</p>  <p><u>Az alábbi típusokhoz megfelel:</u></p>  <ul> 	<li><strong>Bmw F30 Sedan:</strong> 320i xDrive / 328i xDrive / 330i xDrive / 335i xDrive / 340i xDrive / 318d xDrive / 320d xDrive / 330d xDrive / 335d xDrive</li> 	<li>Elülső ültetés: 30-60mm</li> 	<li>Hátsó ültetés: 35-65mm</li> 	<li>Elülső rugó erősség: 30 - 40 N/mm</li> 	<li>Hátsó rugó erősség: 53 - 84 N/mm</li> 	<li>Elülső tengely terhelés: 1001-1040kg</li> 	<li>Hátsó tengely terhelés: 1180kg</li> 	<li>Nem rendelkezik TÜV engedéllyel!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Rugók és lengéscsillapítók tökéletes összhangban vannak</li> 	<li>Plug & play készlet, nem igényel módosítást a felfüggesztésben</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw F32 Coupé, csak xDrive, 2013.07-től, (első tengely terhelés 1001-1040kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f32-coupe-csak-xdrive-2013-07-tol-els-tengely-terheles-1001-1040kg-street-series-allithato-magassagu-futomu'),
(547, '', '<strong>Bmw F33 Cabrio V-Maxx állítható magasságú és keménységű futómű</strong><br />Az alábbi modellekhez: 420i, 425i, 428i, 430i, 435i, 440i, 420d, 425d, 430d<br />Kivéve: xDrive, szintszabályzós és M4<br />Gyártási év: 2013.10-től<br />A futómű 20 különböző keménységi fokozatban állítható!<br />Az első ültetés mértéke: 40-75mm<br />A hátsó ültetés mértéke: 30-75mm<br />Kérjük, vegye figyelembe, hogy a futómű beszereléséhez rövidített stabilizátorrúd szükséges!<br />A termék megfelel a TÜV minősítésnek!', 'V-Maxx Bmw F33 Cabrio, 420i, 425i, 428i, 430i, 435i, 440i, 420d, 425d, 430d, kivéve xDrive, szintszabályzós és M4, 2013.10-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f33-cabrio-420i-425i-428i-430i-435i-440i-420d-425d-430d-kiveve-xdrive-szintszabalyzos-es-m4-2013-10-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(548, '', '<p><strong>A Bmw F32 Coupé modellekhez tervezett futómű</strong></p><br />Az alábbi típusokhoz: 418i, 420i, 425i, 428i, 430i, 435i, 440i, 418d, 420d, 425d, 430d<br />Kivéve: xDrive, szintszabályzós és M4 változatok<br />Évjárat: 2013.07-től<br />A futómű keménysége 20 fokozatban állítható<br />Az elülső ültetés mértéke 40-75mm között variálható<br />A hátsó ültetés mértéke 30-75mm között állítható<br />Fontos tudni, hogy a futómű telepítéséhez szükséges egy rövidített stabilizátorrúd<br />Ez a termék rendelkezik TÜV minősítéssel', 'V-Maxx Bmw F32 Coupé, 418i, 420i, 425i, 428i, 430i, 435i, 440i, 418d, 420d, 425d, 430d, kivéve xDrive, szintszabályzós és M4, 2013.07-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f32-coupe-418i-420i-425i-428i-430i-435i-440i-418d-420d-425d-430d-kiveve-xdrive-szintszabalyzos-es-m4-2013-07-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(549, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy precízen beállítsák a kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás egyesítve van a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg be lehet állítani a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmóniája optimális felhasználói élményt nyújt.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Magas minőség alacsony áron</li>\\r\\n	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>Kiemelkedő ár-érték arány</li>\\r\\n	<li>Német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F33 Cabrio, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2014.03-tól, (első tengely terhelés 913kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f33-cabrio-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2014-03-tol-els-tengely-terheles-913kg-alatt-allithato-magassagu-futomu'),
(550, '', '<div><span>Az Ap futómű kifejezetten azok számára lett tervezve, akik sportosan ambiciózus vezetési stílust preferálnak, és fontos számukra a milliméteres pontossággal állítható ültetés. Az optimális vezetési élmény és sportos irányíthatóság ötvözve a maximális ültetéssel a fő célunk.</span></div>\\r\\n\\r\\n<div>Az alumínium rugótányér segítségével könnyedén beállítható a jármű magassága a TÜV által engedélyezett tartományon belül, így garantálva a sportosságot, kényelmet és biztonságot egyaránt.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Prémium minőség elérhető áron</li>\\r\\n	<li>Egyedi magasságbeállítás a TÜV által engedélyezett határokon belül</li>\\r\\n	<li>Magas minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>Kiemelkedő ár-érték arány</li>\\r\\n	<li>Német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F33 Cabrio, kivéve 4WD és elektronikus futóműszabályzás, 2014.03-tól, (első tengely terhelés 961-1025kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f33-cabrio-kiveve-4wd-es-elektronikus-futomuszabalyzas-2014-03-tol-els-tengely-terheles-961-1025kg-allithato-magassagu-futomu'),
(551, '', '<p>Egy állítható magasságú futómű szett, melyet a BMW F30 típusú autókhoz terveztek. Ez a futómű kiválóan javítja az autó megjelenését, miközben optimális vezetési élményt biztosít. A futómű ültetés mértéke szabadon állítható a felhasználó saját elképzelése alapján, a 25-55 mm-es tartományban elöl, illetve 30-60 mm-es tartományban hátul. A szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítva a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú élettartamot biztosítanak.</p>\n\n<p>A futómű nincs TÜV minősítéssel ellátva, viszont a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Bmw F32 Coupé, csak X-Drive, kivéve Adaptív futóművel szerelt, 2013.10-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-csak-x-drive-kiveve-adaptiv-futomuvel-szerelt-2013-10-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(552, '', '<strong>Bmw F30 Vogtland</strong> állítható magasságú futómû szett</p>  <ul> 	<li><strong>Évjárat</strong>: 2012.02-től</li> 	<li><strong>Ültetés mértéke</strong>: 25 - 55 / 30 - 60 mm</li> 	<li><strong>Típus</strong>: BMW 3 F30, Typ 3L, 4WD, kivéve elektronikus lengéscsillapító</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1001-1090 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1180 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyén igényeinek megfelelően állíthatja be. Ez a futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  <p>A termék nem rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Készült Németországban!</p> ', 'Vogtland Bmw F32 Coupé, csak X-Drive, kivéve Adaptív futóművel szerelt, 2013.10-től, (első tengely terhelés 1001-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-csak-x-drive-kiveve-adaptiv-futomuvel-szerelt-2013-10-tol-els-tengely-terheles-1001-1090kg-allithato-magassagu-futomu'),
(553, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 4-ES (F32)</p>  <ul> 	<li><strong>Évjárat</strong>: 2012.02-től</li> 	<li><strong>Ültetés mértéke</strong>: 40 - 65 / 30 - 60 mm</li> 	<li><strong>Típus</strong>: BMW 4 F32, Typ 3C, Coupé, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 950 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li> </ul>  <p>Az autó megjelenését javító Vogtland állítható magasságú futómű szett nemcsak esztétikailag előnyös, hanem maximális vezetési élményt is nyújt. A futómű szett lehetővé teszi az ültetés mértékének testreszabását az egyéni igények szerint. A kiváló minőségű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a dinamikus vezetési élményt. A lengéscsillapítók korrózióvédelme kiváló minőségű.</p>  <p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén.</p>  <p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968251</p> ', 'Vogtland Bmw F32 Coupé, kivéve 4WD és elektronikus futómű szabályzás, 2013.10-tól, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-kiveve-4wd-es-elektronikus-futomu-szabalyzas-2013-10-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(554, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 4-ES (F33)</p>  \n<ul>  \n	<li><strong>Évjárat</strong>: 2014.03-tól</li>  \n	<li><strong>Ültetés mértéke</strong>: 40 - 65 / 40 - 65 mm</li>  \n	<li><strong>Típus</strong>: BMW 4 F33, Typ 3C, Cabrio, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>  \n	<li><strong>Max. tengelyterhelés elöl</strong>: 1025 kg</li>  \n	<li><strong>Max. tengelyterhelés hátul</strong>: 1265 kg</li> \n</ul>  \n<p>A Vogtland állítható magasságú futómű szett nemcsak javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. Az ültetés mértékét szabadon állíthatja az egyéni igények szerint. A futómű szett kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  \n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótypusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  \n<p>Made in Germany!</p>  \n<p>Cikkszám: 968256</p>  ', 'Vogtland Bmw F33 Cabrio, kivéve 4WD és elektronikus futóműszabályzás, 2014.03-tól, (első tengely terhelés 961-1025kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f33-cabrio-kiveve-4wd-es-elektronikus-futomuszabalyzas-2014-03-tol-els-tengely-terheles-961-1025kg-allithato-magassagu-futomu'),
(555, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 4-ES (F33 / F36)</p>  <ul> 	<li><strong>Évjárat</strong>: 2014.03-tól</li> 	<li><strong>Ültetés mértéke</strong>: 40 - 65 / 40 - 65 mm</li> 	<li><strong>Típus</strong>: BMW 4 F33, Typ 3C, Cabrio, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1265 kg</li> </ul>  <p>Az autó kinézetét javító és kiváló vezetési élményt nyújtó Vogtland állítható magasságú futómű szett. Az ültetés magasságát az egyéni igények szerint állíthatja be. A futómű kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, amelyek garantálják a kiegyensúlyozott komfortot és a dinamikus vezetési élményt. A lengéscsillapítók korrózióállóak és első osztályú minőségűek.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autók esetében.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968255</p> ', 'Vogtland Bmw F33 Cabrio, kivéve 4WD és elektronikus futóműszabályzás, 2014.03-tól, (első tengely terhelés 960kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f33-cabrio-kiveve-4wd-es-elektronikus-futomuszabalyzas-2014-03-tol-els-tengely-terheles-960kg-alatt-allithato-magassagu-futomu'),
(556, '', '<p><strong>Vogtland</strong><span> általános magasságú futómű készlet</span>: BMW 4-ES (F32)</p>  <ul> 	<li><strong>Évjárat</strong>: 2012.02-től</li> 	<li><strong>Ültetés mértéke</strong>: 40 - 65 / 30 - 60 mm</li> 	<li><strong>Típus</strong>: BMW 4 F32, Typ 3C, Coupé, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1090 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett optimális vezetési élményt biztosít. Az ültetés mértékét az egyéni igények szerint állíthatja be. Ez a kiváló minőségű futómű készlet magában foglalja a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek a alacsony nyomású gázrendszernek köszönhetően garantálják az egyensúlyt a kényelem és a dinamizmus között. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A készlet alapvetően 4 db ültetőrugóval és 4 db lengéscsillapítóval rendelkezik, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968252</p> ', 'Vogtland Bmw F32 Coupé, kivéve 4WD és elektronikus futómű szabályzás, 2013.10-tól, (első tengely terhelés 951-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-kiveve-4wd-es-elektronikus-futomu-szabalyzas-2013-10-tol-els-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(557, '', '<div>\n	<p>Ez az állítható magasságú futómű a következő autótípusba illik:</p>\n	<ul>\n		<li>Bmw F32 Coupé iX</li>\n		<li>Tipuskód: F32</li>\n		<li>Évjárat: 2013.10-től</li>\n		<li>Tengelyterhelés elöl (kg): 1000</li>\n		<li>Tengelyterhelés hátul (kg): 1180</li>\n		<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik!</li>\n		<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\n		(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n		<li>Made In Ap-Fahrwerke Németország</li>\n		<li>Garancia erre a termékre: 2 év</li>\n	</ul>\n</div>', 'AP made by KW Bmw F32 Coupé, csak iX, kivéve elektronikus futómű szabályzás, 2013.10-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f32-coupe-csak-ix-kiveve-elektronikus-futomu-szabalyzas-2013-10-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(558, '', '<p>Ez az állítható magasságú AP-Fahrwerke futómű megfelel a következő Bmw F32 Coupé iX modellhez:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: Bmw F32 Coupé iX</li>\\r\\n	<li>Tipuskód: F32</li>\\r\\n	<li>Évjárat: 2013.10-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1001-1090</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1180</li>\\r\\n	<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-65 mm, hátul: 40-65 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n	<li>Made In Ap-Fahrwerke Németország</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F32 Coupé, csak iX, kivéve elektronikus futómű szabályzás, 2013.10-től, (első tengely terhelés 1001-1090kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f32-coupe-csak-ix-kiveve-elektronikus-futomu-szabalyzas-2013-10-tol-els-tengely-terheles-1001-1090kg-allithato-magassagu-futomu'),
(559, '', '<div><span>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetőknek a kívánt ültetés milliméteres pontossággal történő beállítására. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözését biztosítjuk a maximális ültetés mellett.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div>\\r\\n<ul>\\r\\n	<li>kiemelkedő minőség elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>magas minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiemelkedő ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>', 'AP made by KW Bmw F32 Coupé, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2013.10-től, (első tengely terhelés 951-1090kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f32-coupe-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2013-10-tol-els-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(560, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy precízen beállítsák az általuk kívánt üléspozíciót. A sportos irányíthatóságot és az optimális vezetési viselkedést ötvözzük a maximális üléspozícióval.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtjük meg az optimális beállítással.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiemelkedő minőség, megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>különleges ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Bmw F32 Coupé, kivéve 4WD és elektronikus lengéscsillapító szabályzással szerelt, 2013.10-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-f32-coupe-kiveve-4wd-es-elektronikus-lengescsillapito-szabalyzassal-szerelt-2013-10-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(561, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a BMW 4-ES (F32 / F33) modellekhez lett tervezve. A futóművet 2012 februárától lehet használni, és lehetőség van 40-65 mm-es ültetési magasság beállítására. Ez a szett specifikusan a BMW 4 F32, Typ 3C, Coupé, 2WD típusokhoz használható, melyekhez elektronikusan szabályozható futóművet is lehet csatlakoztatni (deaktiváló készlettel).</p>\n<p>Az elő tengely maximális terhelése 950 kg, míg a hátsó tengelyé 1160 kg. Ez a futómű nem csupán esztétikailag javítja az autó megjelenését, hanem fokozza a vezetési élményt is. A kiegyensúlyozott komfort és a dinamika érdekében kizárólag kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel vannak ellátva. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>Ez a minőségi futómű szett TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművet használnak.</p>\n<p>Mindemellett fontos megjegyezni, hogy ez a termék Made in Germany!</p>\n<p>A cikkszám: 968253</p>', 'Vogtland Bmw F32 Coupé, csak elektronikus futómű szabályzás, kivéve 4WD, 2013.10-tól, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-csak-elektronikus-futomu-szabalyzas-kiveve-4wd-2013-10-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(562, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a BMW 4-ES (F32 / F33) modellhez lett tervezve. Az első tengelyterhelés 951-1090 kg, míg a hátsó tengelyterhelés 1160 kg lehet. Ez a minőségi futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott kényelmet és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A TÜV minősítéssel rendelkező termék 2 év garanciával kerül forgalomba, és a rugó gyártás terén több mint 100 éves tapasztalattal rendelkező gyártó cég által készült.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autókat, melyeknél szintezős vagy torziós futómű található. A terméknek Made in Germany a felirata, és a cikkszáma: 968254.</p>', 'Vogtland Bmw F32 Coupé, csak elektronikus futómű szabályzás, kivéve 4WD, 2013.10-tól, (első tengely terhelés 951-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f32-coupe-csak-elektronikus-futomu-szabalyzas-kiveve-4wd-2013-10-tol-els-tengely-terheles-951-1090kg-allithato-magassagu-futomu'),
(563, '', '<p>A MTS-Technik által kínált állítható magasságú sport futóművek ideális választás lehet azoknak, akik számára fontos a kiváló minőség és az kedvező ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális összehangját biztosítják.</p><p><u>Főbb jellemzők:</u></p><ul><li>A futómű rugóit az Eibach gyártja</li><li>A magasság szabadon állítható általában 25 és 80 mm között</li><li>Gáztöltésű lengéscsillapítók</li><li>Magas hatékonyság extrém igénybevétel mellett</li><li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li><li>Tökéletes összhang a rugók és a lengéscsillapítók között</li><li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li></ul>', 'MTS-Technik by Nord Performance Bmw F36 Gran Coupé, kivéve iX és szintszabályzós, 2014.03-tól, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f36-gran-coupe-kiveve-ix-es-szintszabalyzos-2014-03-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(564, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózió ellen (sárga cinkbevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw F36 Gran Coupé, kivéve iX és szintszabályzós, 2014.03-tól, (első tengely terhelés 951-1015kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f36-gran-coupe-kiveve-ix-es-szintszabalyzos-2014-03-tol-els-tengely-terheles-951-1015kg-allithato-magassagu-futomu'),
(565, '', '<p><em>Felhúzható alváz a Bmw F36 Gran Coupé-hoz</em></p><br />Az alábbi modellekhez használható: 418i, 420i, 425i, 428i, 430i, 435i, 440i, 418D, 420D, 425D, 430D, kivéve iX<br />20 eltérő keménységi fokozatban állítható<br />Fontos megjegyzés! Az alváz beépítéséhez rövidített stabilizátorrúd szükséges, mely nem szerepel az árban!<br />Kizárási lista: iX<br />A termék rendelkezik TÜV jóváhagyással<br />Elülső ültetés mértéke: 40-75mm<br />Hátsó ültetés mértéke: 30-75mm', 'V-Maxx Bmw F36 Gran Coupé, 418i, 420i, 425i, 428i, 430i, 435i, 440i, 418D, 420D, 425D, 430D, kivéve iX, 2014.03-tól, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f36-gran-coupe-418i-420i-425i-428i-430i-435i-440i-418d-420d-425d-430d-kiveve-ix-2014-03-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(566, '', '<strong>Bmw F36 Gran Coupé V-Maxx újrahangolható futómű</strong><br />Ez a futómű kompatibilis a következő típusokkal: 418i, 420i, 425i, 428i, 430i, 435i, 440i, 418d, 420d, 425d, 430d, kivéve az xDrive, szintszabályzós és M4 modelleket.<br />Gyártási év: 2014.03-tól<br />A futómű keménysége 20 fokozatban állítható, míg az ültetés mértéke elől 40-75mm, hátul pedig 30-75mm.<br />Fontos: A futómű telepítéséhez szükséges egy rövidített stabilizátorrúd.<br />Ez a termék TÜV minősítéssel rendelkezik!', 'V-Maxx Bmw F36 Gran Coupé, 418i, 420i, 425i, 428i, 430i, 435i, 440i, 418d, 420d, 425d, 430d, kivéve xDrive, szintszabályzós és M4, 2014.03-tól, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-bmw-f36-gran-coupe-418i-420i-425i-428i-430i-435i-440i-418d-420d-425d-430d-kiveve-xdrive-szintszabalyzos-es-m4-2014-03-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(567, '', '<p><strong>Vogtland</strong><span> futómű beállításokra</span>: BMW 4-ES (F33 / F36)</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2014.03-tól</li>\n	<li><strong>Ültetés mértéke</strong>: 40 - 65 / 40 - 65 mm</li>\n	<li><strong>Típus</strong>: BMW 4 F33, Typ 3C, Cabrio, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li>\n	<li><strong>Max. tengelyterhelés hátu</strong>l: 1265 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt. Az ültetés magasságát egyedi elképzelésének megfelelően állíthatja. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a minőséget.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintező vagy torziós futómű van felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968255</p>', 'Vogtland  Bmw F36 Gran Coupé, kivéve iX és szintszabályzós, 2014.03-tól, (első tengely terhelés 960kg alatt) állítható magasságú futómű', '', '', '', 'vogtland--bmw-f36-gran-coupe-kiveve-ix-es-szintszabalyzos-2014-03-tol-els-tengely-terheles-960kg-alatt-allithato-magassagu-futomu'),
(568, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: BMW 4-ES (F33)</p>  \n<ul> 	\n	<li><strong>Évjárat</strong>: 2014.03-tól</li> 	\n	<li><strong>Ültetés mértéke</strong>: 40 - 65 / 40 - 65 mm</li> 	\n	<li><strong>Típus</strong>: BMW 4 F33, Typ 3C, Cabrio, 2WD, kivéve elektronikus lengéscsillapító, kivéve 4WD</li> 	\n	<li><strong>Max. tengelyterhelés elõl</strong>: 1025 kg</li> 	\n	<li><strong>Max. tengelyterhelés hátu</strong>l: 1265 kg</li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. Lehetőség van az ültetés mértékének személyre szabott beállítására. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  \n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>  \n<p>Németországban készült!</p>  \n<p>Cikkszám: 968256</p>  ', 'Vogtland Bmw F36 Gran Coupé, kivéve iX és szintszabályzós, 2014.03-tól, (első tengely terhelés 961-1015kg) állítható magasságú futómű', '', '', '', 'vogtland-bmw-f36-gran-coupe-kiveve-ix-es-szintszabalyzos-2014-03-tol-els-tengely-terheles-961-1015kg-allithato-magassagu-futomu'),
(569, '', '<strong>Bmw M4 BILSTEIN B16 PSS10 állítható magasságú és keménységű futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>BILSTEIN egycsöves rendszerrel</li>\\r\\n	<li>BILSTEIN gáztöltéses technológiával</li>\\r\\n	<li>Egyszerűen beállítható csillapítási erővel</li>\\r\\n	<li>Triple-C-Technology felületkezeléssel készült a hosszú távú korrózióvédelem érdekében</li>\\r\\n	<li>Upside-Down technológiával tervezve</li>\\r\\n	<li>Magas szilárdságú anyagból készült versenysportrugók</li>\\r\\n	<li>Rugótányér és kontra anya alumíniumból a magasság állításához</li>\\r\\n	<li>Húzó és nyomófokozat egyidejűleg 9 fokozatban beállítható</li>\\r\\n	<li>TÜV minősítéssel rendelkezik</li>\\r\\n</ul>\\r\\n\\r\\n<p>Ezzel a futóművel a BILSTEIN mérnökei egy új teljesítménykategóriát hoztak létre! A B16 PSS9-es lengéscsillapítóhoz képest a jármű magassága az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Beépített állapotban egy beállító kerék segítségével 9 különböző karakterisztika közül választható, így biztosítva a jármű professzionális beállítását minden helyzetben.</p>\\r\\n', 'Bilstein Bmw F82 M4 Coupé, kivéve elektronikus lengéscsillapító szabályzás, 2014.04-től, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-bmw-f82-m4-coupe-kiveve-elektronikus-lengescsillapito-szabalyzas-2014-04-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(570, '', '<strong>Bmw M3 BILSTEIN B16 PSS9 állítható magasságú és keménységű futómű</strong></p>\n<ul>\n<li>A BILSTEIN B16 PSS9 egyedülálló egycsöves rendszerrel rendelkezik.</li>\n<li>Használ BILSTEIN speciális gáztöltéses technológiát.</li>\n<li>Lehetőség van egyszerűen beállítani a csillapítási erőt.</li>\n<li>A Triple-C-Technology felületkezelést alkalmazzák a hosszú távú korrózióvédelem érdekében.</li>\n<li>A futómű Upside-Down technológiát használ.</li>\n<li>A versenysportrugók nagy szilárdságú anyagból készülnek.</li>\n<li>A magasság állítható, alumíniumból készült rugótányér és kontra anya segítségével.</li>\n<li>A húzó és nyomófokozat egyidejűleg 9 fokozatban beállítható.</li>\n<li>TÜV minősítéssel rendelkezik.</li>\n</ul>\n<p>A BILSTEIN mérnökei által tervezett futómű egy új teljesítménykategóriát képvisel. A B16 PSS9 lengéscsillapítóval a jármű magassága az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. A beépített állapotban 9 karakterisztika változtatható egy beállító kerék segítségével, biztosítva a jármű professzionális beállítását minden helyzetben.</p>', 'Bilstein Bmw F82 M4 Coupé, elektronikus lengéscsillapító szabályzással szereltekhez, 2014.04-től, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-bmw-f82-m4-coupe-elektronikus-lengescsillapito-szabalyzassal-szereltekhez-2014-04-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(571, '', '<p>Az MTS-Technik által készített állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművek rugóit az Eibach vállalat gyártja.</li> <li>A magasság széles határok között, legtöbb esetben 25 és 80 mm között szabadon állítható.</li> <li>A lengéscsillapítók gáztöltésűek.</li> <li>Magas hatékonyság biztosított extrém igénybevétel mellett is.</li> <li>A hosszú élettartam érdekében két rétegű bevonat található rajta a korrózió ellen (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li> <li>A rugók és a lengéscsillapítók között tökéletes összhang van.</li> <li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében.</li> </ul>', 'MTS-Technik by Nord Performance Bmw F87, kivéve iX és szintszabályzós, 2012.10-től, (első tengely terhelés 920kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f87-kiveve-ix-es-szintszabalyzos-2012-10-tol-els-tengely-terheles-920kg-alatt-allithato-magassagu-futomu'),
(572, '', '<p>A MTS-Technik által kínált állítható magasságú sport futóművek kiváló választás azok számára, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság könnyedén állítható a változó útviszonyoknak megfelelően, így biztosítva az optimális autó hasmagasságot. Az MTS-Technik futóművei kiemelkedő egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p> <p><u>A termék fő jellemzői:</u></p> <ul> <li>A futóművek rugóit az Eibach gyártja</li> <li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Kiemelkedő hatékonyság extrém igénybevétel esetén is</li> <li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében</li> <li>A futóművek tökéletes összhangot biztosítanak a rugók és a lengéscsillapítók között</li> <li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Bmw F87, kivéve iX és szintszabályzós, 2012.10-től, (első tengely terhelés 921-1090kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-f87-kiveve-ix-es-szintszabalyzos-2012-10-tol-els-tengely-terheles-921-1090kg-allithato-magassagu-futomu'),
(573, '', '<strong>BMW E36 Compact MTS-Technik állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>BMW E36 Compact</strong> sorozat keretében elérhető, az alábbi típusokhoz: 316i / 316g / 318ti / 318tds / 323ti</li> 	<li>Gyártási év: 1994.01-2000.08</li> 	<li>Elülső ültetés mértéke: 20-90mm</li> 	<li>Hátsó ültetés mértéke: 10-40mm</li> 	<li>Letöltés: <strong><a href=\\\"https://mtstechnik.com/data/links/bfe422a70f74b029beebae833e4a15dc/26992_84250.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/68ac7375f3f5dc6bbaa6ce70d427f864/26992_84249.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p>Az MTS-Technik által készített sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár. A futómű magassága fokozatmentesen állítható, lehetővé téve az könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiváló egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság rugalmasan állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Bmw Z3, 1995.10-2003.06-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-z3-1995-10-2003-06-ig-street-series-allithato-magassagu-futomu'),
(574, '', '<p>Egy olyan autó futóműve, amely lehetővé teszi a magasság fokozatmentes állítását az útviszonyoknak megfelelően. Az MTS-Technik Comfort Series sport futóművei ideális választások azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem. Ezek a futóművek optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja.</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében.</li>\n	<li>A Comfort Series létrehozása során nem az extrém ültetésre, hanem a magas kényelemre összpontosítottak.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében.</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw Z3, 1995.10-2003.06-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-z3-1995-10-2003-06-ig-comfort-series-allithato-magassagu-futomu'),
(575, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik Sport futóműveinek Eibach rugói és MTS-Technik lengéscsillapítói optimális együttműködést biztosítanak, így maximális vezetési élményt nyújtanak a széles ültetési tartomány mellett. </p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében.</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Bmw Z3, 1995.10-2003.06-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-z3-1995-10-2003-06-ig-sport-series-allithato-magassagu-futomu'),
(576, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett tökéletes választás a BMW Z3 modellekhez. Az évjárat 1995.10-től 2003-ig terjed, és a futómű ültetésének mértéke 35-60 mm elöl és 30-60 mm hátul. Kompatibilis a BMW Z3 Typ R/C, Coupé és Roadster típusokkal, és maximális tengelyterhelése elől 830 kg, míg hátul 870 kg. </p> <p>Ez a kiváló minőségű futómű szett nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az állítható ültetés lehetővé teszi az egyéni beállításokat, míg a kétcsöves lengéscsillapítók alacsony nyomású gázrendszerükkel kiegyensúlyozott komfortot és dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és TÜV minősítéssel ellátottak. A gyártó 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra, és a termék Made in Germany minőséget képvisel.</p> <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintezővel vagy torziós futóművel vannak ellátva. A termék cikkszáma: 968399.</p>', 'Vogtland Bmw Z3 Coupé és Roadster, 1995.10-2003-ig állítható magasságú futómű', '', '', '', 'vogtland-bmw-z3-coupe-es-roadster-1995-10-2003-ig-allithato-magassagu-futomu'),
(577, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómű tökéletesen illeszkedik a következő autótípushoz:</p>\n<ul>\n	<li>BMW Z3 Coupé, Roadster</li>\n	<li>Tipuskód: Z3</li>\n	<li>Évjárat: 1995.10-től</li>\n	<li>Tengelyterhelés elöl (kg): 830</li>\n	<li>Tengelyterhelés hátul (kg): 870</li>\n	<li>Egyéb kitételek: A gyári méretű gumi és felnikombinációnál nyomtávszélesítő felszerelése szükséges!</li>\n</ul>\n<ul>\n	<li>Ez az futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-60 mm, hátul: 30-60 mm között állítható<br />(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +5 mm</li>\n</ul>\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>\n<p><strong>Cikkszáma: GF20-016</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>\n<p>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy az általuk kívánt ültetést milliméter pontossággal beállíthassák. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</p>\n<p>Egy alumínium rugótányér segítségével lehetőség van a járműmagasságot a TÜV által engedélyezett tartományban egyénileg beállítani. A sportosság, a kényelem és a biztonság párhuzamos összehangolása egy optimális felépítést biztosít</p>\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>', 'AP made by KW Bmw Z3 Coupé, Roadster, 1995.10-2003-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-z3-coupe-roadster-1995-10-2003-ig-allithato-magassagu-futomu'),
(578, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a vonzó árakat. A futóművek fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodjon az útviszonyokhoz. Az MTS-Technik futóműveinek kialakításában kiemelt figyelmet kapott a rugók és a lengéscsillapítók optimális egyensúlya.\n\n<u>A futóművek kompatibilisek a következő típusokkal:</u>\n<ul>\n	<li><strong>Bmw Z4 E85 Roadster:</strong> 2.0i / 2.2i / 2.5i / 2.5si / 3.0i / 3.0si</li>\n	<li><strong>Bmw Z4 E86 Coupé:</strong> 3.0si</li>\n	<li>Elülső ültetés: 15-55mm</li>\n	<li>Hátsó ültetés: 15-65mm</li>\n	<li>Elülső tengely terhelés: 790kg</li>\n	<li>Hátsó tengely terhelés: 890kg</li>\n	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/c9478cdf817380b20dcc294bc8bd474c/38925_106297.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/b9cc6bbb961423cdd9089817f728cef0/38925_106296.pdf\\\"><span>szerelési útmutató</span></a></strong></li>\n</ul>\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék jellemzők:</strong></u>\n<img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" />\n\n<em>A weboldalon található tartalmak és képek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Bmw Z4 (E85, E86), 2002.09-2009.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-z4-e85-e86-2002-09-2009-12-ig-street-series-allithato-magassagu-futomu'),
(579, '', '<p>Egy kiváló választás azok számára, akik számára fontos a sportos megjelenés és az utazási kényelem: az MTS-Technik Comfort Series állítható magasságú sport futóművei. A futómű fokozatmentesen állítható magassággal rendelkezik, így könnyedén igazítható az útviszonyokhoz. Az Eibach rugók és az MTS-Technik lengéscsillapítók optimális együttműködésével biztosított az ideális futómű beállítás.</p>  <p><u>A következő típusokhoz illeszkedik:</u></p>  <ul> 	<li><strong>Bmw Z4 E85 Roadster,</strong> 2.0i / 2.2i / 2.5i / 2.5si / 3.0i / 3.0si</li> 	<li><strong>Bmw Z4 E86 Coupé,</strong> 3.0si</li> 	<li>Ültetés mértéke elöl: 15-55mm</li> 	<li>Ültetés mértéke hátul: 15-65mm</li> 	<li>Első tengely terhelés: 790kg</li> 	<li>Hátsó tengely terhelés: 890kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/c9478cdf817380b20dcc294bc8bd474c/38925_106297.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/b9cc6bbb961423cdd9089817f728cef0/38925_106296.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>a <strong>Comfort Series</strong> létrehozása során nem az extrém ültetés, hanem a <strong>magas komfort</strong> volt a fókuszban</li> 	<li>gáztöltéses lengéscsillapítók</li> 	<li>kiemelkedő hatékonyság extrém terhelés mellett is</li> 	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>ideális egyensúly a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmának, képeinek jogtiszta másolása és sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Bmw Z4 (E85, E86), 2002.09-2009.12-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-bmw-z4-e85-e86-2002-09-2009-12-ig-comfort-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(580, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a BMW Z4 típusú autókhoz, évjárattól függetlenül. Ennek a minőségi futómű szettnek köszönhetően nemcsak javíthatja autója megjelenését, hanem maximális vezetési élményt is biztosíthat magának. Az ültetés mértéke széles határok között állítható, lehetőséget adva a személyre szabott beállításokra.</p>\n<p>A futómű szett tartalmazza a speciális, nagy teljesítményű kétcsővel rendelkező lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát nyújtanak. Emellett a lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, így hosszú távon is megbízhatóak maradnak.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát biztosít az ültető rugókra és lengéscsillapítókra.</p>\n<p>A futómű szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968068</p>', 'Vogtland Bmw Z4 (Typ: Z85), 2003.02-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-z4-typ-z85-2003-02-tol-allithato-magassagu-futomu'),
(581, '', '<p>A Vogtland állítható magasságú futómű készlet BMW Z4 típushoz. Az évjárat 2009.04-től, az ültetés mértéke 15-40 / 10-35 mm. A típus BMW Z4, Typ Z89, Coupé, Roadster, kivéve IDS+. A maximális tengelyterhelés elől 870 kg, hátul 1000 kg. Az engedély elérhető itt: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW200GF72_1599-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW200GF72_1599-10.pdf</a></p>\n<p>A termék nemcsak javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. Az ültetés mértékét személyre szabhatja az optimális értékek között. Ez a minőségi futómű készlet tartalmaz speciális, nagy teljesítményű kétcsőves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerrel kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintező- vagy torziós futóművel felszerelt autók esetében.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968257</p>', 'Vogtland Bmw Z4 (Typ: Z89) Coupé és Roadster, 2009.04-től állítható magasságú futómű', '', '', '', 'vogtland-bmw-z4-typ-z89-coupe-es-roadster-2009-04-tol-allithato-magassagu-futomu'),
(582, '', 'Ez az AP-Fahrwerke Állítható magasságú futómű alkalmas a következő BWM Z4 modellekhez, melyekhez a Z85 típuskódú futómű szükséges. A futómű beépítéséhez eredeti gumik és felnik mellett nyomtávszélesítő felszerelése szükséges. A futómű Német nyelvű TÜV engedéllyel rendelkezik, melynek értelmében az ültetés mértéke elől 20-50 mm, hátul 15-40 mm között állítható. A futómű további ültetési lehetőségei elől +10 mm, hátul +10 mm. A gyártó Ap-Fahrwerke, melynek székhelye Németország. A futóműre 2 év garancia vonatkozik. A cikkszám: GF20-004. Az ár egy szettre vonatkozik.', 'AP made by KW Bmw Z4 (Z85), 2003.02-2009-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-z4-z85-2003-02-2009-ig-allithato-magassagu-futomu'),
(583, '', '<p>Ez a moduláris futómű állítható magassággal ideális választás a BMW Z4 Coupé és Roadster modellekhez, kódja Z89, gyártási éve pedig 2009.04-től. A futómű elektromágneses változattal is rendelhető (DCC), azonban ilyen esetekben az elektronikus vezérlőegység deaktiválása szükséges!</p>\n\n<ul>\n	<li>A futómű német nyelvű TÜV engedéllyel rendelkezik.</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 15-40 mm, hátul: 10-35 mm között állítható, de mindig ennél nagyobb intervallumban. A TÜV engedély csak a fent említett beállításokat fedezik.</li>\n	<li>Az ültetés további lehetőségei: elöl +10 mm, hátul +5 mm.</li>\n</ul>\n\n<ul>\n	<li>A futómű Made In Ap-Fahrwerke Németországban készült.</li>\n	<li>A termékre 2 év garancia vonatkozik.</li>\n</ul>\n\n<p><strong>Cikkszám: GF20-072</strong></p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Bmw Z4 (Z89), 2009.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-bmw-z4-z89-2009-04-tol-allithato-magassagu-futomu'),
(584, '', '<div> <div> <p>Ez a Magasságállítható AP-Fahrwerke futóművet Citroen C1 autótípushoz tervezték.</p>  <ul> 	<li>Tipuskód: C1</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2005.06-tól</li> 	<li>Tengelyterhelés elöl (kg): 695</li> 	<li>Tengelyterhelés hátul (kg): 695</li> 	<li>Egyéb kitételek: -</li> </ul>  <ul> 	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-55 mm, hátul: 25-55 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +35 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártási hely: Ap-Fahrwerke, Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszáma: GF95-008</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div> </div>  ', 'AP made by KW Citroen C1 (Typ: P), 2005.06-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-citroen-c1-typ-p-2005-06-tol-allithato-magassagu-futomu'),
(585, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: CITROEN C1</span></div>\n<ul>\n<li><strong>Évjárat</strong>: 2005.06-tól</li>\n<li><strong>Ültetés mértéke</strong>: 25 - 55 / 30 - 60 mm</li>\n<li><strong>Típus</strong>: Citroen C1, Typ P</li>\n<li><strong>Max. tengelyterhelés elõl</strong>: 695 kg</li>\n<li><strong>Max. tengelyterhelés hátu</strong>l: 695 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett kiváló vezetési élményt biztosít ez a futómű szett. Az ültetés mértéke könnyedén beállítható a kívánt értékek között, így személyre szabható. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamizmust biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel rendelkeznek.</p>\n<p>Németországban készült!</p>\n<p>Cikkszám: 968148</p>', 'Vogtland Citroen C1 (Typ: P), 2005.06-tól állítható magasságú futómű', '', '', '', 'vogtland-citroen-c1-typ-p-2005-06-tol-allithato-magassagu-futomu'),
(586, '', '<em>Citroen C2-höz állítható magasságú futómű</em>\\n\\n<ul>\\n<li>Az egyedi futómű különböző motorváltozatokhoz lett tervezve</li>\\n<li>Elülső ültetési lehetőség: 35-70mm, hátsó ültetési lehetőség: 40-70mm</li>\\n<li>Teljes mértékben megfelel a TÜV előírásainak</li>\\n</ul>', 'V-Maxx Citroen C2 (Typ: J), 1.1, 1.4, 1.6, 1.4HDi, 2003-2010-ig állítható magasságú futómű', '', '', '', 'v-maxx-citroen-c2-typ-j-1-1-1-4-1-6-1-4hdi-2003-2010-ig-allithato-magassagu-futomu'),
(587, '', '<div> <div><strong>Citroen C2 Bilstein B14 állítható magasságú futómû</strong></div>  <ul> 	<li>BILSTEIN egycsöves rendszer</li> 	<li>Upside-Down technológiával</li> 	<li>Versenysportrugók nagy szilárdságú anyagból</li> 	<li>Állítható magasság (a rugótányér és a kontra anya alumíniumból készül)</li> </ul>  <div>A B14 PSS futómű a BILSTEIN versenysport technológiáját hozza az utcai használatra. Az állítható magasságú rendszer lehetővé teszi a jármű magasságának akár 50 mm-rel történő csökkentését mind az első, mind a hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</div> </div>  <div> </div> ', 'Bilstein Citroen C2, 2003.09-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-citroen-c2-2003-09-tol-bilstein-b14-allithato-magassagu-futomu'),
(588, '', '<div><strong>Citroen C3 Jom Blueline állítható magasságú futómű</strong></div>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Citroen C3 modellekhez</strong> különböző motorváltozatokkal és évjárattal</li>\\r\\n	<li>Évjárat: 2009-2017</li>\\r\\n	<li>Szárátmérő: 51mm</li>\\r\\n	<li>Tengelyterhelés elöl: 1000 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 900 kg</li>\\r\\n	<li>Gyártás helye: NÉMETORSZÁG</li>\\r\\n	<li>A futómű megfelel a német TÜV engedély követelményeinek, melyet a csomagolás tartalmaz</li>\\r\\n	<li>Garancia: 1 ÉVTELJES</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül kedvező áron</li>\\r\\n	<li>A csomag tartalma: 4 db lengéscsillapító, hozzájuk tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Citroen C3, 2009-2017-ig, 51mm szárátmérő állítható magasságú futómű', '', '', '', 'jom-bochum-citroen-c3-2009-2017-ig-51mm-szaratmer-allithato-magassagu-futomu'),
(589, '', '<strong>Állítható magasságú futómű a Citroen C3 V-Maxx modellhez</strong>\\n\\n<ul>\\n<li>Az alábbi motorváltozatokhoz megfelelő: C3 1.0, 1.1, 1.2THP, 1.2VTi, 1.4, 1.4LPG, 1.4VTi, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi</li>\\n<li>A futóműhöz rövidített stabilizátor szett szükséges</li>\\n<li>Az 51mm szármérőjű típusokhoz alkalmas</li>\\n<li>Elülső ültetés szabályozási tartománya: 35-70mm</li>\\n<li>Hátsó ültetés szabályozási tartománya: 40-70mm</li>\\n<li>A futómű megfelel a TÜV előírásainak</li>\\n</ul>', 'V-Maxx Citroen C3, 1.0, 1.1, 1.2THP, 1.2VTi, 1.4, 1.4LPG, 1.4VTi, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi, 2009.11-2016.07-ig, 51mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-citroen-c3-1-0-1-1-1-2thp-1-2vti-1-4-1-4lpg-1-4vti-1-6thp-1-6vti-1-4hdi-1-6-bluehdi-1-6hdi-2009-11-2016-07-ig-51mm-szaratmer-allithato-magassagu-futomu'),
(590, '', '<strong>Állítható magasságú futómű a Citroen C3-hoz</strong><br /><ul><br /><li>Ez a futómű kompatibilis a következő motorváltozatokkal: 1.0, 1.1, 1.2THP, 1.2VTi, 1.4, 1.4LPG, 1.4VTi, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi</li><br /><li>A rövidített stabilizátor készlet ajánlott a telepítéshez</li><br /><li>Kifejezetten javasolt a 47mm átmérőjű szárral rendelkező típusokhoz</li><br /><li>A futómű elülső ültetésének állítható tartománya: 35-70mm</li><br /><li>A hátsó ültetés állítható tartománya: 40-70mm</li><br /><li>Ez a termék rendelkezik TÜV engedéllyel</li><br /></ul>', 'V-Maxx Citroen C3, 1.0, 1.1, 1.2THP, 1.2VTi, 1.4, 1.4LPG, 1.4VTi, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi, 2009.11-2016.07-ig, 47mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-citroen-c3-1-0-1-1-1-2thp-1-2vti-1-4-1-4lpg-1-4vti-1-6thp-1-6vti-1-4hdi-1-6-bluehdi-1-6hdi-2009-11-2016-07-ig-47mm-szaratmer-allithato-magassagu-futomu'),
(591, '', '<strong>Magasságállítható futómű a Citroen C3 V-Maxx modellehez</strong><br /><ul><br /><li>A különböző motorváltozatokhoz tökéletesen alkalmazható</li><br /><li>Az első ültetés mértéke 35-70mm között állítható</li><br /><li>A hátsó ültetés mértéke 40-70mm között szabályozható</li><br /><li>Minden termék rendelkezik TÜV jóváhagyással</li><br /></ul>', 'V-Maxx Citroen C3, beleértve Pluriel, 2002-2010-ig állítható magasságú futómű', '', '', '', 'v-maxx-citroen-c3-beleertve-pluriel-2002-2010-ig-allithato-magassagu-futomu'),
(592, '', '<div> <div><strong>Citroen C2 Bilstein B14 állítható magasságú futómû</strong></div>  <ul> 	<li>BILSTEIN egycsöves rendszer</li> 	<li>Upside-Down technológiával</li> 	<li>Versenysportrugók nagy szilárdságú anyagból</li> 	<li>Állítható magasság (a rugótányér és a kontra anya alumíniumból készül)</li> </ul>  <div>A B14 PSS futóművével a BILSTEIN mérnökei versenysport technológiát hoznak az utcára. Ennek köszönhetően a jármű magassága csökkenthető akár 50 mm-rel az első és hátsó tengelynél egy 20mm-es állítási tartományon belül. Az egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmények között.</div> </div>  <div> </div>', 'Bilstein Citroen C3, 2002.02-2009.10-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-citroen-c3-2002-02-2009-10-ig-bilstein-b14-allithato-magassagu-futomu'),
(593, '', '<div><strong><span>Citroen C3 Bilstein B14 állítható magasságú futómû</span></strong></div> <div><span>A BILSTEIN által kifejlesztett egycsöves rendszer</span><br /> <span>Innovatív Upside-Down technológia</span><br /> <span>Rugalmasságot és tartósságot biztosító versenysportrugók</span><br /> <span>A futómű állítható magassága lehetővé teszi a rugótányér és kontra anya alumíniumból történő gyártását</span><br /> <span>A B14 modell lehetővé teszi, hogy a jármű magassága akár 50 mm-rel is csökkenjen az első és hátsó tengelyeken, egy 20 mm-es tartományon belül</span><br /> <span>A B14 PSS modellel a BILSTEIN mérnökei az utcára tervezett versenysport technológiát hozták el, amely kiegyensúlyozott menetteljesítményt és vezetési élményt nyújt minden körülmény között</span></div>', 'Bilstein Citroen C3, 2009.11-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-citroen-c3-2009-11-tol-bilstein-b14-allithato-magassagu-futomu'),
(594, '', '<div><strong>Citroen DS3 Jom Blueline állítható magasságú futómű</strong></div>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>A Citroen DS3 modelljei közé tartozik: </strong>1.2THP, 1.4VTi, 1.6 Racing, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi</li>\\r\\n	<li>A gyártási év: 2010-2017</li>\\r\\n	<li>A szárátmérő mérete: 51mm</li>\\r\\n	<li>Az elülső tengely maximális terhelése: 1000 kg</li>\\r\\n	<li>A hátsó tengely maximális terhelése: 900 kg</li>\\r\\n	<li>Gyártási hely: NÉMETORSZÁG</li>\\r\\n	<li>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz</li>\\r\\n	<li>1 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\\r\\n	<li>A szett tartalmazza: 4 darab lengéscsillapítót a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Citroen DS3, 2010-2017-ig, 51mm szárátmérő állítható magasságú futómű', '', '', '', 'jom-bochum-citroen-ds3-2010-2017-ig-51mm-szaratmer-allithato-magassagu-futomu'),
(595, '', 'A Citroen DS3 V-Maxx futómű egy kiváló lehetőség a magasság beállítására. A futómű jellemzői megtalálhatóak az S*****/SA5FD/SA5FF típusú változatban. Ez a futómű ideális választás a 2009.11 és 2016.07 között gyártott Citroen DS3 modellekhez. Különböző motorváltozatokhoz is kompatibilis, többek között: 1.2THP, 1.4VTi, 1.6 Racing, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi. A futómű szárátmérője 47mm. Az elülső ültetési magasság beállítható 35 - 70mm között, míg a hátsó ültetési magasság változtatható 40 - 70mm között. Ezen termék rendelkezik TÜV engedéllyel, így biztos lehet a minőségében. Az optimális működés érdekében javasolt a rövidített stabilizátorrúd használata.', 'V-Maxx Citroen DS3, 1.2THP, 1.4VTi, 1.6 Racing, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi, 2009.11-2016.07-ig, 47mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-citroen-ds3-1-2thp-1-4vti-1-6-racing-1-6thp-1-6vti-1-4hdi-1-6-bluehdi-1-6hdi-2009-11-2016-07-ig-47mm-szaratmer-allithato-magassagu-futomu'),
(596, '', 'Az egyedi Citroen DS3 V-Maxx futóművet a következő típusokhoz ajánljuk: S*****/SA5FD/SA5FF. Az évjárat 2009.11-2016.07 között lehet. A futómű kompatibilis a következő motorokkal: 1.2THP, 1.4VTi, 1.6 Racing, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi. A szármérő 51mm, az elülső ültetés 35 - 70mm, míg a hátsó ültetés 40 - 70mm lehet. Fontos tudni, hogy a termék rendelkezik TÜV engedéllyel, és a használatahoz rövidített stabilizátor rúdra lesz szükség.', 'V-Maxx Citroen DS3, 1.2THP, 1.4VTi, 1.6 Racing, 1.6THP, 1.6VTi, 1.4HDi, 1.6 BlueHDi, 1.6HDi, 2009.11-2016.07-ig, 51mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-citroen-ds3-1-2thp-1-4vti-1-6-racing-1-6thp-1-6vti-1-4hdi-1-6-bluehdi-1-6hdi-2009-11-2016-07-ig-51mm-szaratmer-allithato-magassagu-futomu'),
(597, '', '<div><strong><span>Citroen C3 Bilstein B14 állítható magasságú futómû</span></strong></div> <div><span>A BILSTEIN által kifejlesztett egycsöves rendszer</span><br /> <span>Speciális Upside-Down technológiával</span><br /> <span>Ver­senny­sport­ru­gók készültek nagy szilárdságú anyagból</span><br /> <span>A futómű állítható magassággal rendelkezik, melynek alapját alumíniumból készült rugótányér és kontra anya alkotja</span><br /> <span>A BILSTEIN mérnökei által kifejlesztett B14 modell versenysport technológiát hoz az utcára. Ezzel az innovatív megoldással a jármű magassága akár 50 mm-rel is csökkenthető az első és hátsó tengelyen belül egy 20 mm-es állítási tartományon belül. A B14 PSS rendszer extrém terhelés alatt is biztosítja a kiegyensúlyozott menetteljesítményt és a vezetési élményt az egycsöves Upside-Down technológiájának köszönhetően.</span></div>', 'Bilstein Citroen DS3, 2010.04-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-citroen-ds3-2010-04-tol-bilstein-b14-allithato-magassagu-futomu'),
(598, '', '<em>Állítható magasságú futómű a Citroen Saxo részére</em><br /><ul><br /><li>A különböző Saxo modellekhez kompatibilis</li><br /><li>Az első ültetés mértéke: 35-65mm</li><br /><li>Hátsó rész: torziós futóművel felszerelt</li><br /><li>Minden termék rendelkezik TÜV engedéllyel</li><br /></ul>', 'V-Maxx Citroen Saxo, 1.1i, 1.1SX, 1.4, 1996.05-2003-ig állítható magasságú futómű', '', '', '', 'v-maxx-citroen-saxo-1-1i-1-1sx-1-4-1996-05-2003-ig-allithato-magassagu-futomu'),
(599, '', '<strong>Állítható magasságú futómű Citroen Saxo OPC-hoz a V-Maxx-tól</strong>\\n\\nKompatibilis modellek: \\n1.4i 16V / 1.4 VTS / 1.5D, \\n1.6 VTi / VTR / VTS / 16V\\n\\nAz elülső ültetés mértéke 35-65mm között állítható.\\n\\nA hátsó ültetésnél torziós futómű került alkalmazásra.\\n\\nEz a futómű rendelkezik TÜV engedéllyel.', 'V-Maxx Citroen Saxo, 1.4i 16V, 1.4 VTS, 1.5D, 1.6VTi, VTS, VTR, 16V, 1996.05-2003-ig állítható magasságú futómű', '', '', '', 'v-maxx-citroen-saxo-1-4i-16v-1-4-vts-1-5d-1-6vti-vts-vtr-16v-1996-05-2003-ig-allithato-magassagu-futomu'),
(600, '', '<div><strong>Állítható magasságú futómű a Fiat 500-hoz</strong></div> <div> <div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy milliméteres pontossággal állítsa be az általa kívánt ülésmagasságot. Az optimális vezetési magatartást és sportos irányíthatóságot a maximális ülésmagassággal ötvözzük.</span></div> <div><span>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg lehet beállítani a TÜV által engedélyezett tartományon belül. Az optimális felépítés biztosítja a sportosságot, kényelmet és biztonságot egyaránt.</span></div> <ul>\n    <li><span>megfizethető áron kiváló minőség</span></li>\n    <li><span>egyénileg beállítható magasság a TÜV által engedélyezett tartományon belül</span></li>\n    <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>\n    <li><span>kiemelkedő ár/érték arány</span></li>\n    <li><span>német minőség</span></li>\n</ul> </div>', 'AP made by KW Fiat 500 (Typ: 312), beleértve Abarth, 2007.08-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-500-typ-312-beleertve-abarth-2007-08-tol-allithato-magassagu-futomu'),
(601, '', '<strong>Fiat 500 MTS-Technik Street állítható magasságú sport futómű</strong></p>  <ul> 	<li>A Fiat 500, 500C és Abarth modellekhez készült sport futómű</li> 	<li>első tengely maximális terhelése: 830 kg</li> 	<li>hátsó tengely maximális terhelése: 735 kg</li> 	<li>elülső ültetés mértéke: 15-50 mm</li> 	<li>hátsó ültetés mértéke: 30-65 mm</li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik minőségi és megfizethető megoldást keresnek! A magasság könnyedén állítható a változó útviszonyoknak megfelelően, így az autó hasmagassága könnyedén beállítható. Az MTS-Technik futóművei kiváló összhangban vannak a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>A magasság általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangban</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék jellemzői:</u></p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Fiat 500 (Typ: 312), beleértve Cabrio és Abarth, 2007-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-500-typ-312-beleertve-cabrio-es-abarth-2007-tol-street-series-allithato-magassagu-futomu'),
(602, '', '<p><strong>Vogtland</strong><span> által készített állítható magasságú futómű szett</span>: FIAT 500</p>  <ul> 	<li><strong>Ültetés mértéke</strong>: 30 - 60 / 10 - 40 mm</li> 	<li><strong>Típus</strong>: Fiat 500, Typ 312, beleértve Abarth</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 830 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 735 kg</li> </ul>  <p>A futómű szett nem csupán esztétikailag fejleszti az autó megjelenését, hanem kiemelkedő vezetési élményt nyújt. Az ültetés mértékét saját elképzelése szerint állíthatja be a megfelelő értékeken belül. A kitűnő minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamizmust biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók a tartósságot és megbízhatóságot garantálják.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968009</p> ', 'Vogtland Fiat 500 (Typ: 312), beleértve Abarth, 2007.08-tól állítható magasságú futómű', '', '', '', 'vogtland-fiat-500-typ-312-beleertve-abarth-2007-08-tol-allithato-magassagu-futomu'),
(603, '', '<p>A Vogtland által készített állítható magasságú futómű szett a FIAT 500 autótípushoz készült. Ez a minőségi futómű kizárólag speciális, nagy teljesítményű két csöves lengéscsillapítókkal rendelkezik, melyek alacsony nyomású gázrendszernek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel ellátottak. A termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. A termék Made in Germany!</p><p>Cikkszám: 968149</p>', 'Vogtland Fiat 500, USA modell (Chrysler Group LLC), 2011.01-től állítható magasságú futómű', '', '', '', 'vogtland-fiat-500-usa-modell-chrysler-group-llc-2011-01-tol-allithato-magassagu-futomu'),
(604, '', '<div><strong><span>Fiat 500 Bilstein B14 állítható magasságú futómû</span></strong><br /> <br /> <span>A BILSTEIN egyedi egycsöves rendszerrel rendelkező futóműve kiváló választás a versenysport szerelmeseinek. Az Upside-Down technológiának köszönhetően a futómű kiegyensúlyozott menetteljesítményt és magasfokú vezetési élményt biztosít. A versenysportrugók nagy szilárdságú anyagból készülnek, míg az állítható magasság lehetővé teszi a rugótányér és kontra anya alumíniumból történő gyártását.</span></div>', 'Bilstein Fiat 500, 0.9, 1.2, 1.2 LPG, 1.3 D Multijet, 1.4, 1.4 Abarth, 2008.08-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-fiat-500-0-9-1-2-1-2-lpg-1-3-d-multijet-1-4-1-4-abarth-2008-08-tol-bilstein-b14-allithato-magassagu-futomu'),
(605, '', '<div>Ez az állítható magasságú futómű megfelel a Fiat Bravo 198 típusú autóhoz, melynek gyártási éve 2007.03-tól. Az első tengelyterhelés 1060 kg, míg a hátsó tengelyterhelés 860 kg. A futómű Németországban gyártott, és rendelkezik Német nyelvű TÜV engedéllyel.</div>\n<ul>\n<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 25-50 mm között állítható (a TÜV engedély csak ezekkel az értékekkel érvényes).</li>\n<li>Plussz ültetés lehetőség elöl: +40 mm, hátul: +0 mm.</li>\n</ul>\n<div>A futóműre 2 év garancia van, és a cikkszáma: GF40-018. Az ár 1 szettre vonatkozik.</div>', 'AP made by KW Fiat Bravo (Typ: 198), 2007.03-tól, (M12 menettel) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-bravo-typ-198-2007-03-tol-m12-menettel-allithato-magassagu-futomu'),
(606, '', '<div>\n  <p>Ez az állítható magasságú AP-Fahrwerke futómű megfelel a következő autótípusnak:</p>\n  <ul>\n    <li>Fiat Bravo első lengéscsillapítóval, M10-es csavarral</li>\n    <li>Tipuskód: 198</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 2007.03-tól</li>\n    <li>Tengelyterhelés elöl (kg): 1060</li>\n    <li>Tengelyterhelés hátul (kg): 860</li>\n    <li>Egyéb kitételek: -</li>\n  </ul>\n  <ul>\n    <li>A futómű német nyelvű TÜV engedéllyel rendelkezik</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 25-50 mm között állítható<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokra érvényes)</li>\n    <li>Plussz ültetési lehetőség elöl: +40 mm, hátul: +0 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártva Németországban, AP-Fahrwerke által</li>\n    <li>2 év garancia a termékre</li>\n  </ul>\n  <p><strong>Cikkszám: GF40-019</strong></p>\n  <p><br /> Az ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Fiat Bravo (Typ: 198), 2007.03-tól, (M10 menettel) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-bravo-typ-198-2007-03-tol-m10-menettel-allithato-magassagu-futomu'),
(607, '', '<p>A Vogtland által készített állítható magasságú futómű szett Fiat Bravo típushoz, 2007-től gyártott modellekhez. Az ültetés mértéke 35 - 65 mm-el elöl, és 25 - 50 mm-el hátul. A futómű M12 menetű csavarokkal rögzíthető. Az elülső tengely maximális terhelése 1060 kg, míg a hátsóé 860 kg. A termék minőségét TÜV minősítés igazolja. A szett tartalmaz 4 db ültetőrugót és 4 db kétcsöves lengéscsillapítót, melyek kiváló korrózióvédelmet biztosítanak. A gyártó 2 év garanciát vállal a termékre. Kizárólag speciális, nagy teljesítményű lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A Vogtland futóművek németországi gyártásúak és hosszú évek tapasztalatával rendelkeznek a rugókészítés terén. Cikkszám: 968007</p>', 'Vogtland Fiat Bravo (Typ: 198), 2007.03-tól, (M12 menettel) állítható magasságú futómű', '', '', '', 'vogtland-fiat-bravo-typ-198-2007-03-tol-m12-menettel-allithato-magassagu-futomu'),
(608, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett specifikusan a FIAT BRAVO modellekhez lett tervezve. Ez az újítás 2007-től elérhetővé vált, és lehetővé teszi az ültetés mértékének személyre szabott beállítását. A futóműcsomag tartalmazza az M10 csavar menetű Fiat Bravo, Typ 198 modellekhez tervezett kiváló minőségű lengéscsillapítókat, amelyek garantálják az optimális kényelmet és dinamikát alacsony nyomású gázrendszerüknek köszönhetően.</p>\n<p>Az elől maximálisan elviselhető tengelyterhelés 1060 kg, míg hátul ez az érték 860 kg. A futómű engedélyezett és TÜV minősítéssel rendelkezik, biztosítva ezzel a megbízhatóságot és biztonságot. A gyártó cég, amely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n<p>A futóműszett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak. A futómű Made in Germany minőségi pecséttel rendelkezik, így garantálva a megbízhatóságot és a tartósságot.</p>\n<p>Cikkszám: 968008</p>', 'Vogtland Fiat Bravo (Typ: 198), 2007.03-tól, (M10 menettel) állítható magasságú futómű', '', '', '', 'vogtland-fiat-bravo-typ-198-2007-03-tol-m10-menettel-allithato-magassagu-futomu'),
(609, '', '<p>Az MTS-Technik által kifejlesztett Street állítható magasságú sport futóművek ideális választást nyújtanak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futómű magassága fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes egyensúly van a rugók és a lengéscsillapítók között.</p> <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Fiat Seicento, </strong>0.9 / 1.1 / 1.1 Sporting</li> 	<li>Elülső ültetés: 35-95mm</li> 	<li>Hátsó ültetés: 45-90mm</li> 	<li>Elülső tengely terhelése: 610kg</li> 	<li>Hátsó tengely terhelése: 630kg</li> </ul>  <p><u>Főbb jellemzők:</u></p>  <ul> 	<li>Rugók gyártója: <strong>Eibach</strong></li> 	<li>Magasság állítási tartomány: általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes egyensúlya</li> 	<li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  ', 'MTS-Technik by Nord Performance Fiat Cinquecento (Typ: 170), 0.9, 1.1, 1.1 Sporting, 1997.07-1999.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-cinquecento-typ-170-0-9-1-1-1-1-sporting-1997-07-1999-07-ig-street-series-allithato-magassagu-futomu'),
(610, '', '<p>Az MTS-Technik Sport sorozatú állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik Sport állítható futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n<p><u>A következő típusokhoz passzol:</u></p>\n<ul>\n	<li>Fiat Seicento, 0.9 / 1.1 / 1.1 Sporting</li>\n	<li>Ültetés mértéke elöl: 35-100mm</li>\n	<li>Ültetés mértéke hátul: 75-95mm</li>\n	<li>Elülső tengely terhelés: 610kg</li>\n	<li>Hátsó tengely terhelés: 630kg</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Fiat Cinquecento (Typ: 170), 0.9, 1.1, 1.1 Sporting, 1997.07-1999.07-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-cinquecento-typ-170-0-9-1-1-1-1-sporting-1997-07-1999-07-ig-sport-series-allithato-magassagu-futomu'),
(611, '', '<p>Állítható magasságú futómű a FK-Automotive-től, az AK Street modell.</p>\n\n<ul>\n	<li>Autótípus: Fiat Grande Punto (Typ 199)</li>\n	<li>Évjárat: 2005.09-től</li>\n</ul>\n\n<p>Lehetőség van az első és hátsó magasságának szabályozására, nagy intervallumban. Ez az egyik legkiemelkedőbb alapszintű állítható futómű a piacon, amely kiváló minőségű anyagokból készül. A futómű sportos, feszes és rendkívül strapabíró, amellett, hogy növeli a kanyarstabilitást és javítja a vezetési élményt. A futómű rendelkezik német nyelvű TÜV engedéllyel, és az ültetés mértéke 35-65 mm között állítható. Anyaga: Acél.</p>\n\n<ul>\n	<li>Cikkszám: SMFI9005</li>\n</ul>', 'FK-Automotive Fiat Grande Punto (Typ: 199), 2005.09-től állítható magasságú futómű', '', '', '', 'fk-automotive-fiat-grande-punto-typ-199-2005-09-tol-allithato-magassagu-futomu'),
(612, '', '<p>A MTS-Technik állítható magasságú sport futóművei remek választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár. Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően, mivel fokozatmentesen állítható. Az MTS-Technik futóművei ideális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az Eibach gyártja</li> 	<li>A magasság széles tartományban, általában 25 és 80 mm között állítható</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>A készlet könnyedén telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Fiat Grande Punto, 2005.10-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-grande-punto-2005-10-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(613, '', '<div><span>Az Ap futómű a sportosan ambiciózus vezetők igényeinek megfelelően lehetővé teszi a milliméteres pontosságú ültetés beállítását. A sportos irányíthatóságot és optimális vezetési viselkedést kombinálva a maximális ültetési lehetőséget biztosítjuk.</span></div> <div><span>A járműmagasság egyénileg beállítható egy alumínium rugótányér segítségével, mely a TÜV által engedélyezett tartományban történik. A sportosság, kényelem és biztonság harmonikus egyensúlyban van, hogy optimális teljesítményt nyújtson.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Individuális magasságbeállítás a TÜV által engedélyezett határok között</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiemelkedő ár-érték arány</span></li>     <li><span>Német minőségű</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</span></div>', 'AP made by KW Fiat Grande Punto (Typ: 199), beleértve Abarth, 2005.10-től, (első tengely terhelés 900kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-grande-punto-typ-199-beleertve-abarth-2005-10-tol-els-tengely-terheles-900kg-alatt-allithato-magassagu-futomu'),
(614, '', '<div><span>Az Ap futómű ideális választás a sportosan ambiciózus vezetők számára, akik precízen szeretnék beállítani az autójuk ültetését. Kiemelkedő sportos irányíthatóságot és optimális vezetési viselkedést kínálunk, maximális ültetéssel párosítva.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetőség van az autó magasságának egyéni beállítására a TÜV által engedélyezett tartományban belül. A sportosság, kényelem és biztonság egyidejű összehangolása optimális konfigurációt eredményez.</span></div> <ul>     <li><span>Magas minőségű termék megfizethető áron</span></li>     <li><span>Egyéni magasságbeállítás TÜV engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiemelkedő ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem!</span></div>', 'AP made by KW Fiat Grande Punto (Typ: 199), beleértve Abarth, 2005.10-től, (első tengely terhelés 901-1000kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-grande-punto-typ-199-beleertve-abarth-2005-10-tol-els-tengely-terheles-901-1000kg-ig-allithato-magassagu-futomu'),
(615, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás lehet Fiat Grande Punto típusú autójához, évjárattól függetlenül. Ennek a minőségi terméknek a segítségével nemcsak javíthatja járműve megjelenését, hanem maximális vezetési élményt is biztosíthat magának. Az ültetés mértékét egyedi elképzeléseinek megfelelően állíthatja be, a tartomány 35-65 / 35-60 mm között változhat.</p>\n\n<p>Az állítható magasságú futómű szett tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, így hosszú távon is megbízhatóak.</p>\n\n<p>Ez a TÜV minősítéssel rendelkező termék 2 év garanciát kínál az ültetőrugókra és a lengéscsillapítókra. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, így biztos lehet benne, hogy minőségi terméket kap. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Ne feledje, hogy ez a minőségi termék Made in Germany! Cikkszám: 968504</p>', 'Vogtland Fiat Punto Grande, beleértve Abarth, 2005.10-től, (első tengely terhelés 900kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-fiat-punto-grande-beleertve-abarth-2005-10-tol-els-tengely-terheles-900kg-alatt-allithato-magassagu-futomu'),
(616, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a FIAT PUNTO autókhoz, kifejezetten a 2005.10-től gyártott modellekhez. Ez a futómű kitűnő lehetőséget kínál arra, hogy testreszabottan állítsd az autód ültetését, a 35-65 mm-es elülső és a 35-60 mm-es hátsó ültetési mértéknek köszönhetően. Kompatibilis Fiat Grande Punto, Typ 199 és Abarth típusokkal is.</p> <p>Ez a minőségi futómű szett exkluzív, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, így hosszú távon is megbízhatóak maradnak.</p> <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugóval és 4 db lengéscsillapítóval érkezik, kivéve azoknál az autótípusoknál, melyek más futóművet használnak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968505</p>', 'Vogtland Fiat Punto Grande, beleértve Abarth, 2005.10-től, (első tengely terhelés 901-1000kg) állítható magasságú futómű', '', '', '', 'vogtland-fiat-punto-grande-beleertve-abarth-2005-10-tol-els-tengely-terheles-901-1000kg-allithato-magassagu-futomu'),
(617, '', '<p>A Bilstein B14 egy állítható magasságú sport futómű, melyet a Fiat Grande Punto számára terveztek. Ez a tuning futómű lehetővé teszi, hogy testre szabhassuk autónk futóművét, hogy jobb teljesítményt és vezethetőséget érjünk el. A Bilstein B14 Fiat Grande Punto futómű egy kiváló választás azok számára, akik szeretnék javítani autójuk futóművét és sportosabb vezetési élményt szeretnének. </p>\\r\\n', 'Bilstein Fiat Grande Punto, 2005.10-től, Bilstein B14 állítható magasságú sport futómű állítható magasságú futómű', '', '', '', 'bilstein-fiat-grande-punto-2005-10-tol-bilstein-b14-allithato-magassagu-sport-futomu-allithato-magassagu-futomu'),
(618, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómű tökéletesen illeszkedik a következő autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Fiat Punto, beleértve a Cabrio változatot is</li>\\r\\n	<li>Tipuskód: 176</li>\\r\\n	<li>Évjárat: 1993.09-tól</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 850</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 700</li>\\r\\n	<li>Egyéb információk: Az első futómű magassága állítható, míg a hátsó futómű fix. A futóműszett tartalmazza a hátsó ültetőrugókat és a lengéscsillapítókat is.</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetési lehetőség elöl: 30-60 mm, hátul: kb. 40 mm között állítható<br />\\r\\n	(Megjegyzés: bár a futómű nagyobb intervallumban is állítható, a TÜV engedély kizárólag a fenti beállításokra vonatkozik.)</li>\\r\\n	<li>Plusz ültetési lehetőség elöl: +40 mm, hátul: +0 mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártva: Ap-Fahrwerke, Németország</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Fiat Punto 1 (Typ: 176), beleértve Cabrio, 1993.03-1999.05-ig, AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-punto-1-typ-176-beleertve-cabrio-1993-03-1999-05-ig-ap-allithato-magassagu-futomu'),
(619, '', '<p>A Vogtland futóművek kiváló minőségű alkatrészei között megtalálhatók az állítható magasságú futóművek, sport futóművek és Gewinde (menetes) futóművek. Ezek a tuning futóművek lehetővé teszik az autó ültetését és a magasság szabályozását a Vogtland márkára jellemző precizitással.</p>', 'Vogtland Fiat Punto (Typ: 176), beleértve Cabrio, 1993.09-től, Vogtland állítható magasságú futómű', '', '', '', 'vogtland-fiat-punto-typ-176-beleertve-cabrio-1993-09-tol-vogtland-allithato-magassagu-futomu'),
(620, '', '<div>\n<p>Ez a módosítható magasságú AP-Fahrwerke futómű az alábbi autótípushoz illik:</p>\n\n<ul>\n	<li>Fiat Punto, beleértve a Facelift változatot</li>\n	<li>Tipuskód: 188</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1999.09-től</li>\n	<li>Tengelyterhelés elöl (kg): 900</li>\n	<li>Tengelyterhelés hátul (kg): 750</li>\n	<li>Egyéb információk: Az első futómű magassága állítható, míg a hátsó futómű fix. A szett tartalmazza a hátsó ültetőrugókat (40mm) és a lengéscsillapítókat is.</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>A TÜV engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: kb. 40 mm<br />\n	(Mindig nagyobb intervallumban is beállítható a futómű, azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>További ültetési lehetőség elöl: +55 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártva Ap-Fahrwerke németországi gyárában</li>\n	<li>2 év garancia a termékre</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11540007</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Fiat Punto 2 (Typ: 188), beleértve Facelift, 1999.06-2008-ig, (hátul nem állítható) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-punto-2-typ-188-beleertve-facelift-1999-06-2008-ig-hatul-nem-allithato-allithato-magassagu-futomu'),
(621, '', '<div><strong>Fiat Punto (Typ: 188) Vogtland állítható magasságú sport futómű</strong></div> <div> </div> <div>Az autó elülső részének magassága 30-60 mm-rel csökkenthető, míg a hátsó részének magassága 40 mm-rel (nem állítható) csökkenthető.</div> <div> </div> <div>Ez a futómű a következő típusokhoz illeszkedik: Punto, 1.2 8V, 1.2 16V, 1.4, 1.3JTD, 1.8HGT, 1.9D, 1.9JTD</div> <div> </div> <div>Az e termék rendelkezik TÜV engedéllyel.</div>', 'Vogtland Fiat Punto (Typ: 188), beleértve Facelift, 1999.06-2008-ig, (hátul nem állítható) állítható magasságú futómű', '', '', '', 'vogtland-fiat-punto-typ-188-beleertve-facelift-1999-06-2008-ig-hatul-nem-allithato-allithato-magassagu-futomu'),
(622, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akiknek fontos a kiváló minőség és az előnyös ár! A magasság fokozatmentesen állítható, így könnyedén lehet igazítani az autó hasmagasságát az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiemelkedő hatékonyság extrém terhelés mellett is</li> 	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>ideális összhang a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> ', 'MTS-Technik by Nord Performance Fiat Punto (Typ: 199), beleértve EVO, 2008.07-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-punto-typ-199-beleertve-evo-2008-07-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(623, '', '<p>Az MTS-Technik által kifejlesztett Street futóművei ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futómű fokozatmentesen állítható magassággal rendelkezik, lehetővé téve a könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális egyensúly van a rugók és a lengéscsillapítók között.</p> <p><u>A futómű az alábbi típusokhoz illeszkedik:</u></p> <ul> <li>Fiat Seicento, 0.9 / 1.1 / 1.1 Sporting</li> <li>Elülső ültetés: 35-95mm</li> <li>Hátsó ültetés: 45-90mm</li> <li>Elülső tengely terhelés: 610kg</li> <li>Hátsó tengely terhelés: 630kg</li> </ul> <p><u>Jellemzők:</u></p> <ul> <li>A futómű rugóit az Eibach vállalat gyártja</li> <li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Magas hatékonyság extrém terhelés mellett is</li> <li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> <li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> <li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul> <p><u><strong>Termék jellemzői:</strong></u></p> <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Fiat Seicento (Typ: 187), 0.9, 1.1, 1.1 Sporting, 1997.11-2010.01-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-seicento-typ-187-0-9-1-1-1-1-sporting-1997-11-2010-01-ig-street-series-allithato-magassagu-futomu'),
(624, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen szabályozható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik Sport állítható futóművei tökéletes egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között, ami maximális vezetési élményt biztosít széles ültetési tartománnyal.</p> <p><u>A következő típusokhoz ajánlott:</u></p> <ul> 	<li>Fiat Seicento, 0.9 / 1.1 / 1.1 Sporting</li> 	<li>Ültetés mértéke elöl: 35-100mm</li> 	<li>Ültetés mértéke hátul: 75-95mm</li> 	<li>Első tengely terhelés: 610kg</li> 	<li>Hátsó tengely terhelés: 630kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók a maximális sportosság érdekében</li> 	<li>A Sport Series létrehozása során a fokozott vezetési élmény mellett a szélesebb ültetési tartomány volt a fő szempont</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék karakterisztika:</strong></u></p>  <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Fiat Seicento (Typ: 187), 0.9, 1.1, 1.1 Sporting, 1997.11-2010.01-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-fiat-seicento-typ-187-0-9-1-1-1-1-sporting-1997-11-2010-01-ig-sport-series-allithato-magassagu-futomu'),
(625, '', '<p>Egy olyan sport futómű, amely lehetővé teszi a vezető számára, hogy milliméteres pontossággal beállítsa a kívánt ülésmagasságot. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját kínálva, maximalizálva az ülésmagasságot.</p>\n\n<p>A járműmagasság beállítható egy alumínium rugótányér segítségével, a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes összhangja optimális konfigurációt biztosít.</p>\n\n<ul>\n	<li>kiváló minőségű termék megfizethető áron</li>\n	<li>egyéni magasságbeállítás TÜV engedélyezett tartományban</li>\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár-érték arány</li>\n	<li>német minőség</li>\n</ul>', 'AP made by KW Fiat Stilo (Typ: 192) Limousine, beleértve Diesel, kivéve 1.9 JDT 103kW, 2001.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-stilo-typ-192-limousine-beleertve-diesel-kiveve-1-9-jdt-103kw-2001-10-tol-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(626, '', '<p><strong>FIAT Stilo AP állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Első futómű rögzítő furat távolsága: 72mm</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az AP sport futómű lehetőséget biztosít a sportosan vezetni szerető sofőröknek, hogy milliméterre szabják az autó magasságát. Az optimális vezetési élmény és sportos irányíthatóság ötvözetét nyújtjuk maximális ültetéssel.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével az autó magasságát egyénileg beállíthatjuk a TÜV által jóváhagyott határok között. Az autó sportosságát, kényelmét és biztonságát egyaránt figyelembe véve optimális beállítást garantálunk.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által jóváhagyott határok között</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Fiat Stilo (Typ: 192) Limousine, 1.9 JDT 103kW, 2001.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-stilo-typ-192-limousine-1-9-jdt-103kw-2001-10-tol-allithato-magassagu-futomu'),
(627, '', '<p><strong>FIAT Stilo AP sport futómű magasságállítással</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Első futómű rögzítő furat távolsága: 58mm</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az AP sport futómű lehetőséget biztosít a sportosan beállított ültetés precíz finomhangolására. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözésével garantáltan maximális teljesítményt nyújt.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a jármű magasságát szabályozhatjuk az engedélyezett határok között. Ennek eredményeképpen a sportosság, kényelem és biztonság tökéletes összhangban állnak egymással, biztosítva az optimális teljesítményt.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű alkatrészek megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás az engedélyezett határokon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kivételes ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Fiat Stilo (Typ: 192) Limousine Abarth, 2001.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-fiat-stilo-typ-192-limousine-abarth-2001-10-tol-allithato-magassagu-futomu'),
(628, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett, melyet Fiat Stilo modellekhez terveztek, lehetővé teszi az autó ültetésének testreszabását 35-60 / 20-50 mm tartományban. Ez a minőségi futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók optimális vezetési élményt nyújtanak, miközben javítják az autó megjelenését.</p>\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapesetben 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968506</p>', 'Vogtland Fiat Stilo, beleértve Diesel, kivéve Kombi és 1.9JTD, 2001.10-től állítható magasságú futómű', '', '', '', 'vogtland-fiat-stilo-beleertve-diesel-kiveve-kombi-es-1-9jtd-2001-10-tol-allithato-magassagu-futomu'),
(629, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelelő választás lehet a FIAT STILO típusú autókhoz, melyek 2001-től gyártottak. Ennek az újításnak köszönhetően javítható az autó megjelenése és növelhető a vezetési élmény. Az ültetés mértékét egyénileg is beállíthatja a kívánt értékek között. A minőségi futómű szett tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így garantálva a komfortos és dinamikus vezetést. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>Ez a TÜV minősítéssel ellátott termék a rugógyártás terén 100 éves tapasztalattal rendelkező gyártó cég által kerül forgalomba. Az ültető rugókra és lengéscsillapítókra 2 év garanciát vállalnak. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek más típusú futóművel rendelkeznek.</p>\n<p>A termék Made in Germany!</p>\n<p>Cikkszám: 968507</p>', 'Vogtland Fiat Stilo, 1.9JTD, kivéve Kombi, 2001.10-től állítható magasságú futómű', '', '', '', 'vogtland-fiat-stilo-1-9jtd-kiveve-kombi-2001-10-tol-allithato-magassagu-futomu'),
(630, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett, mely megfelel a FIAT STILO típusnak. Az évjárat 2001-től, az ültetés mértéke 15 - 40 / 15 - 45 mm között állítható. A futómű kitűnő választás Fiat Stilo, Typ 192, Abarth modellekhez. A maximális tengelyterhelés elöl 1030 kg, míg hátul 960 kg.</p> \n<p>Ez a futómű szett nem csupán javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. Az ültetés mértékét saját igényei szerint szabályozhatja. A kiváló minőségű futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p>\n<p>A futómű szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintezővel vagy torziós futóművel vannak felszerelve.</p>\n<p>Termékünk Made in Germany!</p>\n<p>Cikkszám: 968684</p>', 'Vogtland Fiat Stilo Abarth, 2001.10-től állítható magasságú futómű', '', '', '', 'vogtland-fiat-stilo-abarth-2001-10-tol-allithato-magassagu-futomu'),
(631, '', '<p>Ez a magasságállítható futómű kompatibilis a következő autótípushoz:</p>\n<ul>\n    <li>Ford Fiesta Villás végű gátlóval</li>\n    <li>Tipuskód: JAS, JBS</li>\n    <li>Típusváltozat:</li>\n    <li>Évjárat: 1995.08 - 1998</li>\n    <li>Tengelyterhelés elöl (kg): 860</li>\n    <li>Tengelyterhelés hátul (kg): 750</li>\n    <li>Egyéb megjegyzés: Kizárólag azokba a modellekbe illik, melyek hátsó lengéscsillapítói villás kialakításúak.</li>\n</ul>\n<ul>\n    <li>Ez a futómű összeállítás rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 35-75 mm, hátul: 35-75 mm között állítható\n    (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n    <li>Extra ültetési lehetőség elöl: +25 mm, hátul: +30 mm</li>\n</ul>\n<ul>\n    <li>Gyártó: Ap-Fahrwerke, Németország</li>\n    <li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF30-001</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>', 'AP made by KW Ford Fiesta (Typ: JAS, JBS), 1995.08-1998-ig, hátul villás rögzítés, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-fiesta-typ-jas-jbs-1995-08-1998-ig-hatul-villas-rogzites-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(632, '', '<p>Ez az állítható magasságú futómű a következő autótípushoz illik:</p>\n<ul>\n	<li>Ford Fiesta Szemes végzõdésû gátló</li>\n	<li>Tipuskód: JAS, JBS</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1999-től</li>\n	<li>Tengelyterhelés elöl (kg): 860</li>\n	<li>Tengelyterhelés hátul (kg): 750</li>\n	<li>Egyéb kitételek: Kizárólag azokba a modellekbe, melyeknek a hátsó lengéscsillapítói szemes kialakításúak.</li>\n</ul>\n<ul>\n	<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-75 mm, hátul: 35-75 mm között állítható (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +25 mm, hátul: +30 mm</li>\n</ul>\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>\n<p><strong>Cikkszáma: GF30-011</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>', 'AP made by KW Ford Fiesta (Typ: JAS, JBS), 1999-től, hátul szemes rögzítés, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-fiesta-typ-jas-jbs-1999-tol-hatul-szemes-rogzites-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(633, '', '<p>A Vogtland állítható magasságú futómű készlet ideális választás a FORD FIESTA modellekhez. Az évek 1995-1998 között gyártott autókhoz ajánljuk, melyekhez 35-75 / 35-75 mm-es ültetési mértéket lehet beállítani. Ez a készlet kifejezetten a Ford Fiesta, Typ JAS, JBS típusokhoz lett tervezve. Az elülső tengelyterhelés maximum 860 kg, míg a hátsó tengelyterhelés maximum 750 kg lehet.</p>\n<p>Az autó megjelenésén javítva, ez a futómű készlet optimális vezetési élményt nyújt. Az ültetés mértékét egyedileg is beállíthatja a kívánt értékek között. A készlet magas teljesítményű, speciális kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968324</p>', 'Vogtland Ford Fiesta, (Typ: JAS, JBS), 1995.08-1998-ig, hátul villás rögzítés, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-ford-fiesta-typ-jas-jbs-1995-08-1998-ig-hatul-villas-rogzites-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(634, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: FORD FIESTA</p> <ul> <li><strong>Évjárat</strong>: 1999-től</li> <li><strong>Ültetés mértéke</strong>: 35 - 75 / 35 - 75 mm</li> <li><strong>Típus</strong>: Ford Fiesta, Typ JAS, JBS</li> <li><strong>Max. tengelyterhelés elöl</strong>: 860 kg</li> <li><strong>Max. tengelyterhelés hátul</strong>: 750 kg</li> <li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW300GF01-11_1484-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW300GF01-11_1484-10.pdf</a></li> </ul> <p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt ez a futómű szett. A beállítható ültetés mértékének köszönhetően testre szabhatja az autó magasságát. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott kényelmet és a dinamikus vezetést. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más típusú futóművel vannak felszerelve.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968325</p>', 'Vogtland Ford Fiesta, (Typ: JAS, JBS), 1999-től, hátul szemes rögzítés, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-ford-fiesta-typ-jas-jbs-1999-tol-hatul-szemes-rogzites-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(635, '', '<strong>Állítható futómű a Ford Fiesta Mk5 Jom Bochum-tól</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Típuskódok: JH1, JD3</li>\\r\\n	<li>Gyártási időszak: 2004.11 - 2008</li>\\r\\n	<li>Elülső tengelyterhelés: 900 kg</li>\\r\\n	<li>Hátsó tengelyterhelés: 815 kg</li>\\r\\n	<li>Kiterjesztve az ST150 modellekre is</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártási hely: NÉMETORSZÁG</li>\\r\\n	<li>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, mely a csomagolás része.</li>\\r\\n	<li>Garancia: 24 hónap</li>\\r\\n	<li>Kiemelkedő minőség, lenyűgöző áron!</li>\\r\\n	<li>A szett tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Ford Fiesta (Typ: JH1/JD3), 2004.11-2008-ig állítható magasságú futómű', '', '', '', 'jom-bochum-ford-fiesta-typ-jh1jd3-2004-11-2008-ig-allithato-magassagu-futomu'),
(636, '', '<p>Állítható magasságú futómű, mely ideális választás a Ford Fiesta (JH1/JD3) típusú autókhoz (2001-2008). A futómű ültetésének mértéke 30-60 mm között változtatható, mind elöl, mind hátul. A FK-Automotive AK Street futómű sportos, feszes és strapabíró kialakítású, nagy intervallumban állítható magassággal. A termék rendelkezik német nyelvű TÜV engedéllyel, anyaga pedig acél. Cikkszáma: FO9007.</p>', 'FK-Automotive Ford Fiesta (Typ: JH1/JD3), 2001-2008-ig állítható magasságú futómű', '', '', '', 'fk-automotive-ford-fiesta-typ-jh1jd3-2001-2008-ig-allithato-magassagu-futomu'),
(637, '', '<strong>Ford Fiesta MTS-Technik Street állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Ford Fiesta (Typ: JH1, JD3), </strong>1.25 16V / 1.3 / 1.4 16V / 1.6 16V / ST150 / 1.4TDCi / 1.6TDCi</li> 	<li>Évjárat: 2001.11-2014.12-ig</li> 	<li>Első tengely terhelés: 900kg alatt</li> 	<li>Hátsó tengely terhelés: 810kg alatt</li> 	<li>Ültetés mértéke elől: 20-70mm</li> 	<li>Ültetés mértéke hátul: 45-80mm</li> 	<li>Rugó erősség (első, fő rugó): 34 - 40 - 70 N/mm</li> 	<li>Rugó erősség (hátsó, fő rugó): 21 - 25 - 30 N/mm</li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azoknak, akik kiváló minőséget és megfizethető árat keresnek! A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  <p><em>A weboldal szöveges tartalmainak, képeinek másolása és sokszorosítása engedély nélkül tilos!</em></p>', 'MTS-Technik by Nord Performance Ford Fiesta (Typ: JH1, JD3), beleértve ST150, 2001.11-2014.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-fiesta-typ-jh1-jd3-beleertve-st150-2001-11-2014-12-ig-street-series-allithato-magassagu-futomu'),
(638, '', '<div>\n    <p>Ez az állítható magasságú futómű megfelel a következő Ford Fiesta típusnak:</p>\n    <ul>\n        <li>Típus: ST150</li>\n        <li>Tipuskódok: JH1, JD3</li>\n        <li>Típus variáció:</li>\n        <li>Évjárat: 2001.11-től</li>\n        <li>Tengelyterhelés elöl (kg): 900</li>\n        <li>Tengelyterhelés hátul (kg): 810</li>\n        <li>Egyéb kitételek: -</li>\n    </ul>\n    <ul>\n        <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 40-70 mm, hátul: 35-65 mm között állítható<br />(Nagyobb intervallumban is beállítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n        <li>Plusz ültetés lehetőség elöl: +15 mm, hátul: +5 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: Ap-Fahrwerke Németország</li>\n        <li>Garancia: 2 év</li>\n    </ul>\n    <p><strong>Cikkszám: </strong>11530018</p>\n    <p><br />\n    Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Ford Fiesta (Typ: JH1, JD3), beleértve ST150, 2001.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-fiesta-typ-jh1-jd3-beleertve-st150-2001-11-tol-allithato-magassagu-futomu'),
(639, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás lehet a FORD FIESTA modellekhez, melyek gyártási éve 2001-től kezdődnek. Ez a szett lehetővé teszi az ültetés mértékének szabályozását 40-70 mm-el elöl és 35-65 mm-el hátul. Kompatibilis a Ford Fiesta típusokkal, beleértve a Typ JH1, JD3, valamint az ST150 verziót is.</p>\n<p>Az általános specifikációk között szerepel, hogy a maximális tengelyterhelés elöl 900 kg, míg hátul 810 kg lehet. A futómű engedélyezett és minősített a <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW300GF18_1493-10.pdf\" target=\"_blank\">megfelelő dokumentum</a> alapján.</p>\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. A kiváló minőségű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, amelyek kiegyensúlyozott komfortot és dinamikus vezetést biztosítanak. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>A termék \"Made in Germany\" jelzéssel rendelkezik, cikkszáma: 968508.</p>', 'Vogtland Ford Fiesta, (Typ: JH1, JD3), beleértve ST150, 2001.11-től állítható magasságú futómű', '', '', '', 'vogtland-ford-fiesta-typ-jh1-jd3-beleertve-st150-2001-11-tol-allithato-magassagu-futomu'),
(640, '', '<strong>Bilstein B14 állítható magasságú futómű</strong><br /> <br /> Az egyedi BILSTEIN futóműrendszer Upside-Down technológiával van ellátva, és versenysportrugókat használ, melyek nagy szilárdságú anyagból készültek. Az állítható magasság lehetővé teszi a rugótányér és a kontra anya alumíniumból történő gyártását. A B14 futómű versenysport technológiát kínál az utcai használatra, és a BILSTEIN mérnökei által megvalósított elképzelés nagy előnyökkel jár. A B14 PSS segítségével a jármű magassága az első és hátsó tengelyen akár 50 mm-rel is csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű B14 PSS futómű egycsöves Upside-Down technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmények között.</p>', 'Bilstein Ford Fiesta MK6, 2001.09-től állítható magasságú futómű', '', '', '', 'bilstein-ford-fiesta-mk6-2001-09-tol-allithato-magassagu-futomu'),
(641, '', '<div>\\nAz új Ford Fiesta V-Maxx sport futóművel érkezik, melynek magassága szabályozható.\\n</div>', 'V-Maxx Ford Fiesta (Typ: JA8, JR8), beleértve ST, 2008-tól állítható magasságú futómű', '', '', '', 'v-maxx-ford-fiesta-typ-ja8-jr8-beleertve-st-2008-tol-allithato-magassagu-futomu'),
(642, '', '<div>\n    <p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómû</strong> tökéletesen illeszkedik a következő autótípushoz:</p>\n    <ul>\n        <li><strong>Ford Fiesta</strong></li>\n        <li><strong>Tipuskód:</strong> JA8</li>\n        <li><strong>Évjárat:</strong> 2008.10-től</li>\n        <li><strong>Tengelyterhelés elöl (kg):</strong> 850</li>\n        <li><strong>Tengelyterhelés hátul (kg):</strong> 785</li>\n        <li>Ez a futóműkészlet rendelkezik Német nyelvű TÜV engedéllyel!</li>\n        <li>Az engedély által meghatározott ültetés mértéke elöl: 30-55 mm, hátul: 30-60 mm között állítható (A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokat engedélyezi.)</li>\n        <li>Plussz ültetési lehetőség elöl: +65 mm, hátul: +0 mm</li>\n        <li>Made In Ap-Fahrwerke Németország</li>\n        <li>Garancia a termékre: 2 év</li>\n    </ul>\n    <p><strong>Cikkszáma:</strong> 11530040</p>\n    <p><br />Az ár egy szettre értendő!</p>\n</div>', 'AP made by KW Ford Fiesta (Typ: JA8), 2008.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-fiesta-typ-ja8-2008-10-tol-allithato-magassagu-futomu'),
(643, '', '<strong>Vogtland</strong> állítható magasságú futómû szett: FORD FIESTA</p>  <ul> 	<li><strong>Évjárat</strong>: 2008-tól</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 55 / 30 - 60 mm</li> 	<li><strong>Típus</strong>: Ford Fiesta, Typ JA8, kivéve ST</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 850 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 785 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW300GF40_1496-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW300GF40_1496-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt ez a futómű szett. A beállítások lehetővé teszik az ültetés mértékének testreszabását az egyéni igények szerint. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek a alacsony nyomású gázrendszertől egyensúlyozott kényelmet és dinamizmust biztosítanak. Az első osztályú korrózióvédelemmel rendelkező lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel és 2 év garanciát biztosít a gyártó, aki már több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más típusú futóművel vannak felszerelve.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968326</p>', 'Vogtland Ford Fiesta, (Typ: JA8), 2008.10-től állítható magasságú futómű', '', '', '', 'vogtland-ford-fiesta-typ-ja8-2008-10-tol-allithato-magassagu-futomu'),
(644, '', '<ul>\n	<li><strong>Ford Focus MK1 Jom Blueline állítható magasságú futómű</strong></li>\n	<li>Típuskód: DAW, DBW, DFW, DAX, DBX, DA1, DB1</li>\n	<li>KIZÁRÓLAG nem megfelelő kombi modellekhez!</li>\n	<li>Évjárat: 1998 - 2004</li>\n	<li>A hátsó tengelynél fix magasságú ültetőrugó (40-50mm)</li>\n	<li>Tengelyterhelés elöl: 965 kg</li>\n	<li>Tengelyterhelés hátul: 930 kg</li>\n</ul>\n\n<ul>\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\n	<li>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalál.</li>\n	<li>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</li>\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!</li>\n	<li>A szett tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</li>\n</ul>', 'Jom Bochum Ford Focus MK1, kivéve Kombi, 1998-2004-ig, BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-ford-focus-mk1-kiveve-kombi-1998-2004-ig-blueline-allithato-magassagu-futomu'),
(645, '', '<p>Ez az állítható magasságú futómű alkalmas a következő autótípusra:</p>\n\n<ul>\n	<li>Ford Focus </li>\n	<li>Tipuskód: DAW, DBW, DFW</li>\n	<li>Kivéve Kombi</li>\n	<li>Évjárat: 1998.10-től</li>\n	<li>Tengelyterhelés elöl (kg): 965</li>\n	<li>Tengelyterhelés hátul (kg): 930</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-60 mm, hátul: 35-60 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +25 mm, hátul: +0 mm</li>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>\n\n<p>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési élmény ötvözésével, maximalizálva az ültetési magasságát.</p>\n\n<p>Egy alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományon belül. A sportosság, a kényelem és a biztonság harmóniája optimális felhasználói élményt nyújt.</p>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>', 'AP made by KW Ford Focus MK1, kivéve Kombi, 1998-2004-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-mk1-kiveve-kombi-1998-2004-ig-allithato-magassagu-futomu'),
(646, '', '<p>Az Ap futómű megoldást nyújt a sportosan ambiciózus vezetők számára, akik precízen szeretnék beállítani az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatja a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság összehangolása egy optimális felépítést eredményez.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Ford Focus MK1 Kombi, 1999.02-2005-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-mk1-kombi-1999-02-2005-ig-allithato-magassagu-futomu'),
(647, '', '<strong>Vogtland</strong> állítható magasságú futómű szett a FORD FOCUS modellekhez</p>  <ul> 	<li><strong>Évjárat</strong>: 1998-2004</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 55 / 35 - 50 mm</li> 	<li><strong>Típus</strong>: Ford Focus, Typ DAW, DBW, DFW, DAX, DBX, DA1, DB1, kivéve Kombi</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 965 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 930 kg</li> </ul>  <p>A Vogtland futómű szett nemcsak esztétikailag fejleszti az autót, hanem optimális vezetési élményt is biztosít. Az ültetés mértékét személyre szabhatja a megfelelő értékek között. Ez a prémium minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültető rugókra és lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968509</p> ', 'Vogtland Ford Focus MK1, kivéve Kombi, 1998-2004-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk1-kiveve-kombi-1998-2004-ig-allithato-magassagu-futomu'),
(648, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: FORD FOCUS</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1999-2005 között</li>\n	<li><strong>Ültetés mértéke</strong>: 35 - 55 / 35 - 50 mm</li>\n	<li><strong>Típus</strong>: Ford Focus, Typ DNW, DNX, DN1, Turnier</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 960 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1010 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. Ennek a kiváló minőségű futómű szettnek részei a speciális, nagy teljesítményű kétcsöves lengéscsillapítók, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek első osztályú minőségben.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968327</p>', 'Vogtland Ford Focus MK1 Kombi, 1999-2005-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk1-kombi-1999-2005-ig-allithato-magassagu-futomu'),
(649, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kompatibilis a FORD FOCUS RS modellekkel. Ez a minőségi futómű szett a maximális vezetési élményt és az autó megjelenésének javítását célozza. Az ültetés mértéke 10 - 40 mm között állítható, és tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat. Ezek a lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, ami biztosítja a kiegyensúlyozott komfortot és fokozott dinamikát. Emellett kiváló korrózióvédelemmel rendelkeznek.</p> <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén. Az ültetőrugókra és lengéscsillapítókra 2 év garanciát vállalnak. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>A termék Made in Germany!</p>', 'Vogtland Ford Focus RS (Typ: DBY-RS), 2002.10-től állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-rs-typ-dby-rs-2002-10-tol-allithato-magassagu-futomu'),
(650, '', '<p>Az alábbi futómű passzol a Ford Focus MK2 típusú autókhoz, kivéve a Cabrio, Kombi és ST 2.5 modelleket. Az érvényes évjárat 2004.11-től 2010-ig terjed. Az elő tengelyterhelés 1070 kg, míg a hátsó tengelyterhelés 1090 kg. A futómű rendelkezik német nyelvű TÜV engedéllyel. Az engedélyben meghatározott ültetés mértéke elől 30-65mm, míg hátul a magasság nem állítható (40mm ültetőrugóval). Fontos megjegyzés, hogy bár a futómű szinte minden esetben nagyobb intervallumban is állítható, a TÜV engedély csak a fent említett beállításokkal érvényes. A termék Made In Germany.</p>', 'Jom Bochum Ford Focus MK2, kivéve Kombi, 2004.11-2010-ig, BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-ford-focus-mk2-kiveve-kombi-2004-11-2010-ig-blueline-allithato-magassagu-futomu'),
(651, '', '<p>Állítható magasságú futómű a FK-Automotive AK Street termékcsaládból.</p>\n\n<ul>\n	<li>Autótípus: Ford Focus 2</li>\n	<li>Évjárat: 2004.10-től</li>\n	<li>Kivéve: Kombi</li>\n</ul>\n\n<ul>\n	<li>Elöl és hátul is változtatható a magasság</li>\n	<li>A futómű nagy tartományban állítható</li>\n	<li>Kiemelkedő minőségű, sportos és strapabíró</li>\n	<li>Javítja a kanyarstabilitást és a vezetési élményt</li>\n	<li>Német TÜV engedéllyel rendelkezik</li>\n	<li>Állítási tartomány: 35-75 mm</li>\n	<li>Anyaga: Acél</li>\n</ul>\n\n<ul>\n	<li>Cikkszám: SMFO9003</li>\n</ul>', 'FK-Automotive Ford Focus MK2, kivéve Kombi, 2004.11-2010-ig állítható magasságú futómű', '', '', '', 'fk-automotive-ford-focus-mk2-kiveve-kombi-2004-11-2010-ig-allithato-magassagu-futomu'),
(652, '', '<strong>Állítható magasságú V-Maxx sport futómű a Ford Focus ST-hez</strong><br /><p>A Ford Focus (DA3 típus) autóhoz készült</p><br /><p>2.5 ST motorral</p><br /><p>Elülső ültetés mérlege: 30-70mm</p><br /><p>Hátsó ültetés mérlege: 30-60mm</p><br /><p>TÜV engedéllyel rendelkező termék</p><br /><p> </p>', 'V-Maxx Ford Focus (Typ: DA3), 2.5 ST, 2005.10-2011.03-ig állítható magasságú futómű', '', '', '', 'v-maxx-ford-focus-typ-da3-2-5-st-2005-10-2011-03-ig-allithato-magassagu-futomu'),
(653, '', '<p><strong>Ford Focus MK2 Kombi MTS-Technik Street Series rugózásának magasságát lehet állítani</strong></p>  <p><u>Ez a felsorolás az alábbi típusokhoz megfelelő:</u></p>  <ul> 	<li><strong>Ford Focus MK2 (Typ: DA) Kombi,</strong> 1.4 / 1.6 / 1.6 Ti / 1.6 LPG / 1.8 / 1.8 Flexifuel / 2.0 / 2.0 LPG / 1.6 TDCi / 1,8 TDCi / 2.0 TDCi</li> 	<li>Első tengely terhelése: 1070kg</li> 	<li>Hátsó tengely terhelése: 1090kg</li> 	<li>Elülső ültetés mértéke: 30-70mm</li> 	<li>Hátsó ültetés mértéke: 30-80mm</li> </ul>  <p>A MTS-Technik rugós sport futóművei kiváló választás azoknak, akik értékelik a kiváló minőséget és az megfizethető árat. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimálisan működnek együtt.</p>  <p><u>Fontos jellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművekhez az <strong>Eibach</strong> gyártja a rugókat</li> 	<li><strong>a termék rendelkezik TÜV engedéllyel</strong></li> 	<li>a magasság széles tartományban állítható, általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>kitűnő összhang a rugók és a lengéscsillapítók között</li> 	<li>a készlet telepítése egyszerű, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><img alt=\\\"\\\" src=\\\"http://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  <p><em>A weboldalon szereplő szöveges és képi tartalom másolása és terjesztése engedély nélkül tilos!</em></p>', 'MTS-Technik by Nord Performance Ford Focus MK2 (Typ: DA) Kombi, 2004.07-2012.09-ig, (első tengely terhelés 1070kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-focus-mk2-typ-da-kombi-2004-07-2012-09-ig-els-tengely-terheles-1070kg-alatt-street-series-allithato-magassagu-futomu'),
(654, '', '<strong>Mazda 3 MTS-Technik Street Series állítható magasságú sport futómű</strong></p>  <p><u>Az alábbi modellekhez ajánlott:</u></p>  <ul> 	<li>Mazda 3 (Typ: BK) Sedan, 1.6 / 2.0 / 1.6Di Turbo / 2.0CD</li> 	<li>Mazda 3 (Typ: BK) hatchback, 1.4 / 1.6 / 2.0 / 1.6CD / 1.6Di Turbo / 2.0CD</li> 	<li>Első tengely terhelés: 1110kg</li> 	<li>Hátsó tengely terhelés: 1075kg</li> 	<li>Elülső ültetési mérték: 25-70mm</li> 	<li>Hátsó ültetési mérték: 15-60mm</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/ce2e11cfc26cae4145239b10d0f2354c/28458_5592.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/f2c3a39d21bcdf0d10de2eb96ac83404/28458_5591.pdf\\\"><span>szerelési útmutató</span></a></strong><br /> 	 </li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik kiemelkedő minőséget és versenyképes árat keresnek! Az állítható magasságú futómű könnyedén alkalmazkodik az útviszonyokhoz, így optimalizálva az autó hasmagasságát! Az MTS-Technik futóművei ideális egyensúlyt teremtenek a rugók és lengéscsillapítók között. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit a <strong>Eibach</strong> gyártja</li> 	<li><strong>a termék rendelkezik TÜV engedéllyel</strong></li> 	<li>a magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>gázamortizációval ellátott lengéscsillapítók</li> 	<li>kiváló hatékonyság extrém terhelés mellett is</li> 	<li>dupla rétegű bevonat a tartós korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>ideális egyensúly a rugók és lengéscsillapítók között</li> 	<li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><img alt=\\\"\\\" src=\\\"http://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és terjesztése tilos!</em></p> ', 'MTS-Technik by Nord Performance Ford Focus MK2 (Typ: DA, DB), beleértve C-Max, kivéve Kombi, 2004.07-2012.09-ig, (első tengely terhelés 1110kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-focus-mk2-typ-da-db-beleertve-c-max-kiveve-kombi-2004-07-2012-09-ig-els-tengely-terheles-1110kg-alatt-street-series-allithato-magassagu-futomu'),
(655, '', '<p>Ez a magasságállítható AP-Fahrwerke futómű alkalmas a következő autótípushoz:</p>\n\n<ul>\n	<li>Ford Focus RS</li>\n	<li>Tipuskód: DA_</li>\n	<li>Típus variáció: 2.5 RS</li>\n	<li>Évjárat: 2004.07-2013.09-ig</li>\n	<li>Tengelyterhelés elöl (kg): 1040</li>\n	<li>Tengelyterhelés hátul (kg): 920</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 25-50 mm, hátul: 20-45 mm között állítható \n	(Minden esetben ennél nagyobb intervallumban lehet beállítani a futóművet, azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>Gyártva Ap-Fahrwerke Németországban</li>\n	<li>2 év garancia ezen termékre</li>\n</ul>', 'AP made by KW Ford Focus RS MK2, 2.5 RS Turbo, 2.5 RS 500 Turbo, 2004.07-2013.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-rs-mk2-2-5-rs-turbo-2-5-rs-500-turbo-2004-07-2013-09-ig-allithato-magassagu-futomu'),
(656, '', '<div>\n	<p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómû</strong> megfelel a következő autótípusnak:</p>\n	<ul>\n		<li>Ford Focus ST 2.5</li>\n		<li>Tipuskód: DA_</li>\n		<li>Típus variáció: 2.5 ST</li>\n		<li>Évjárat: 2004.07-2013.09-ig</li>\n		<li>Tengelyterhelés elöl (kg): 1050</li>\n		<li>Tengelyterhelés hátul (kg): 990</li>\n		<li>Ez a futómű Németországban gyártott és rendelkezik Német nyelvű TÜV engedéllyel!</li>\n		<li>Az engedélyben meghatározott ültetés mértéke elöl: 10-40 mm, hátul: 15-45 mm között állítható (Mindig ennél nagyobb intervallumban lehet beállítani a futóművet, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n		<li>Gyártó: Made In Ap-Fahrwerke Németország</li>\n		<li>Garancia időtartama: 2 év</li>\n	</ul>\n</div>', 'AP made by KW Ford Focus ST MK2, 2.5 ST, 2004.07-2013.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-st-mk2-2-5-st-2004-07-2013-09-ig-allithato-magassagu-futomu'),
(657, '', '<strong>Vogtland</strong> állítható magasságú futómû szett: FORD FOCUS</p>  <ul> 	<li><strong>Évjárat</strong>: 2005.01-2011.03</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 60 / 40 - 70 mm</li> 	<li><strong>Típus</strong>: Ford Focus, Typ DA3, DB3, Turnier</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1070 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1090 kg</li> </ul>  <p>A futómű kiválóan frissíti az autó kinézetét és emellett magas szintű vezetési élményt biztosít. A beállítás lehetőségeinek köszönhetően testreszabhatja az üléspozíciót a saját igényei szerint. A futóműszett kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott kényelmet és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók kiváló korrózióállósággal rendelkeznek.</p>  <p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A futóműszett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező- vagy torziós futóművet alkalmaznak.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968006</p>', 'Vogtland Ford Focus MK2 (Typ DA3, DB3) Turnier, 2005.01-2011.03-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk2-typ-da3-db3-turnier-2005-01-2011-03-ig-allithato-magassagu-futomu'),
(658, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a FORD FOCUS autókhoz, melyek gyártási éve 2004.12 és 2011.03 közöttiek. Ennek a futómű szettnek a segítségével nemcsak javítható az autó megjelenése, de maximalizálható a vezetési élmény is. A szett lehetőséget biztosít arra, hogy saját elképzelése alapján állítsa be az ültetés mértékét a 30-60 mm-es tartományban elöl, illetve a 35-65 mm-es tartományban hátul.</p>\n<p>A Vogtland futómű szett kifejezetten a Ford Focus, Typ DA3, DB3 típusokhoz készült, kivéve az ST modelleket. Az elő tengely maximális terhelése 1070 kg, míg a hátsó tengelyé 1015 kg.</p>\n<p>Ez a kiváló minőségű futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyozott kényelmet és dinamikát nyújtanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968511</p>', 'Vogtland Ford Focus MK2 (Typ: DA3, DB3), kivéve Kombi és ST, 2004.12-2011.03-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk2-typ-da3-db3-kiveve-kombi-es-st-2004-12-2011-03-ig-allithato-magassagu-futomu'),
(659, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a FORD FOCUS 2005.12-2011.03 közötti évjárathoz. Ez a minőségi futómű szett kizárólag Ford Focus Typ DA3, DB3, csak ST típusú autókhoz ajánlott. Az ültetés mértéke 10 - 40 mm-el elöl és 15 - 45 mm-el hátul állítható, lehetővé téve számodra, hogy az autó megjelenését és vezetési élményét saját elképzeléseid szerint alakítsd.\n\nEz a speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot és megbízhatóságot.\n\nA termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.\n\nA szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.\n\nMade in Germany!\n\nCikkszám: 968718</p>', 'Vogtland Ford Focus (Typ: DA3), csak ST, kivéve Kombi, 2005.12-2011.03-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-typ-da3-csak-st-kiveve-kombi-2005-12-2011-03-ig-allithato-magassagu-futomu'),
(660, '', '<ul>\n    <li>Az autó modellje: Ford Focus 2 Limousine</li>\n    <li>Tipuskód: DA3, DB3</li>\n    <li>Változatosság: Limousine</li>\n    <li>Évjárat: 2004.12-tõl</li>\n    <li>Elülső tengelyterhelés: 1070 kg</li>\n    <li>Hátsó tengelyterhelés: 1015 kg</li>\n    <li>Egyéb információk: -</li>\n</ul>\n<ul>\n    <li>Ez a futómű Németországban gyártott, és rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetési lehetőségek: elöl 35-65 mm, hátul 35-65 mm között állítható (természetesen ennél nagyobb intervallumban is beállítható a futómű, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n    <li>Extrém ültetési lehetőség: elöl +30 mm, hátul +0 mm</li>\n</ul>\n<ul>\n    <li>Gyártó: Ap-Fahrwerke Németország</li>\n    <li>Garancia időtartama: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF30-021</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Ford Focus MK2 (Typ: DA3, DB3) Sedan, 2004.12-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-mk2-typ-da3-db3-sedan-2004-12-tol-allithato-magassagu-futomu'),
(661, '', '<br /><ul><br /><li>Egy autó modell, amelynek típuskódja DA3 és DB3.</li><br /><li>A jármű a Turnier típusú.</li><br /><li>Gyártási éve 2005 januárjától kezdődik.</li><br /><li>Az autó első tengelyterhelése 1070 kg, míg a hátsó tengelyé 1090 kg.</li><br /><li>Nincs más megkötés a termékkel kapcsolatban.</li><br /></ul><br /><br /><br /><ul><br /><li>Ez a futómű Németországban készült, rendelkezik Német nyelvű TÜV engedéllyel.</li><br /><li>Az engedélyben meghatározott ülés magassága elől 35-65 mm, hátul ugyancsak 35-65 mm között állítható.</li><br /><li>Ezenkívül van lehetőség további +20 mm előtti, +0 mm hátsó ültetésre is.</li><br /></ul><br /><br /><br /><ul><br /><li>A termék Németországban készült, Ap-Fahrwerke gyártmányú.</li><br /><li>Garanciális időtartama 2 év.</li><br /></ul><br /><br /><br /><p><strong>Cikkszáma: </strong>11530022</p><br />', 'AP made by KW Ford Focus MK2 (Typ: DA3, DB3) Turnier, 2005.01-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-mk2-typ-da3-db3-turnier-2005-01-tol-allithato-magassagu-futomu'),
(662, '', '<p><strong>Bilstein B14 állítható magasságú futómű</strong></p>\n<p><br /></p>\n<p>BILSTEIN egycsöves rendszerrel rendelkezik</p>\n<p>Fejjel lefelé technológiával</p>\n<p>Versenysportrugók magas szilárdságú anyagból készültek</p>\n<p>Állítható magasságú (az alumíniumból készült rugótányér és kontra anya segítségével)</p>\n<p>Versenysport technológia az utcára, a B14-gyel a BILSTEIN mérnökei ezt az elképzelést valósították meg, ami hatalmas előnyt jelent. A B14 PSS-nél a jármű magasságát az első és hátsó tengelynél legfeljebb 50 mm-rel lehet csökkenteni, egy meghatározott 20 mm-es állítási tartományon belül. A B14 PSS rendkívül ellenálló egycsöves Fejjel lefelé technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben.</p>', 'Bilstein Ford Focus MK2, 2004.11-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-ford-focus-mk2-2004-11-tol-bilstein-b14-allithato-magassagu-futomu'),
(663, '', '<strong>Bilstein B14 állítható magasságú futómű</strong><br />\\r\\n<br />\\r\\nAz egyedülálló BILSTEIN futómű rendszer<br />\\r\\nInnovatív Upside-Down technológia felhasználásával<br />\\r\\nKiváló minőségű versenysport rugók<br />\\r\\nÁllítható magasság alumíniumból készült rugótányér és kontra anya segítségével<br />\\r\\nA B14 futóművet a BILSTEIN mérnökei úgy tervezték, hogy versenysport technológiát vigyenek az utcai autókba. A B14 PSS lehetőséget biztosít a jármű magasságának csökkentésére akár 50 mm-rel az első és hátsó tengelynél, egy 20mm-es állítási tartományon belül. Az extrém terhelhetőségű egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és vezetési élményt minden körülmények között.', 'Bilstein Ford Focus ST MK2, 2.5 ST, 2004.07-2013.09-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-ford-focus-st-mk2-2-5-st-2004-07-2013-09-ig-bilstein-b14-allithato-magassagu-futomu'),
(664, '', '<p>Ford Focus MK3 Jom Állítható Magasságú Futómû</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus:Ford Focus Typ: DYB</li>\\r\\n	<li>Évjárat: 2010 -tõl</li>\\r\\n	<li>KIVÉVE: Kombi és ST modellek!</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű ültetése 35-65 mm között állítható</li>\\r\\n	<li>A futómű magassága elöl és hátul is szabályozható</li>\\r\\n	<li>A Jom Blueline futómű nagy intervallumban módosítható</li>\\r\\n	<li>A futómű sportos, feszes és tartós</li>\\r\\n	<li>Magas minőségű, német TÜV engedéllyel ellátott</li>\\r\\n	<li>A futómű anyaga: Acél</li>\\r\\n	<li>Elöl terhelhetőség: 1100kg alatt</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Ford Focus MK3, kivéve Kombi és ST, 2010-től, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-ford-focus-mk3-kiveve-kombi-es-st-2010-tol-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(665, '', 'Egy olyan FK-Automotive AK Street futómű, melynek magassága állítható.<br />Ez a futómű alkalmas Ford Focus modellekhez (kivéve a kombi és ST verziókat) 2010-től.<br />Az ültetés mértéke változtatható kb. 25-55 mm között mind az első, mind a hátsó tengelynél.<br />A futómű rendkívül sportos, feszes és nagy rugalmasságot kínál a magasság beállításában.<br />Ennek a futóműnek van német TÜV engedélye, és az anyaga acél.<br />Az első terhelhetősége meghaladja a 991 kg-ot, a cikkszáma pedig SMFO9031.', 'FK-Automotive Ford Focus MK3, kivéve Kombi és ST, 2010-től, (első tengely terhelés 991kg fölött) állítható magasságú futómű', '', '', '', 'fk-automotive-ford-focus-mk3-kiveve-kombi-es-st-2010-tol-els-tengely-terheles-991kg-folott-allithato-magassagu-futomu'),
(666, '', '<p>Állítható magasságú FK-Automotive AK Street futómű a Ford Focus 3 Typ: C346 típushoz, évjárat 2010-től, kivéve a Kombi és ST modelleket!</p>\n<ul>\n	<li>Az ültetés mértéke 25 - 55 mm között variálható</li>\n	<li>A futómű elöl és hátul is állítható magasságú</li>\n	<li>Ez a futómű sportos, feszes és nagy intervallumban állítható magasságú</li>\n	<li>Német nyelvű TÜV engedéllyel rendelkezik</li>\n	<li>Anyaga: Acél</li>\n	<li>Terhelhetőség: elöl: 990kg-ig</li>\n	<li>Cikkszám: SMFO9031-01</li>\n</ul>', 'FK-Automotive Ford Focus MK3, kivéve Kombi és ST, 2010-től, (első tengely terhelés 990kg alatt) állítható magasságú futómű', '', '', '', 'fk-automotive-ford-focus-mk3-kiveve-kombi-es-st-2010-tol-els-tengely-terheles-990kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(667, '', '<strong>MTS-Technik Street állítható magasságú sport futómű a Ford Focus MK3-hoz</strong></p>\\r\\n\\r\\n<p>Az MTS-Technik sport futóművei kiváló választást nyújtanak azoknak, akik számára fontos a minőség és az ár-érték arány. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben optimális összhang van a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Ford Focus MK3 Hatchback:</strong> 1.0 EcoBoost / 1.5 EcoBoost / 1.6 Ti / 1.6 LPG / 1.6 Flexifuel / 1.6 EcoBoost / 2.0 / 2.0 Ti-GDi / 2.0 ST / 1.5 TDCi / 1.6 TDCi / 2.0 TDCi / 2.0 TDCi ST</li>\\r\\n	<li><strong>Ford Focus MK3 Hatchback Facelift:</strong> 1.0 EcoBoost / 1.5 EcoBoost / 1.6 Ti / 1.6 LPG / 1.6 Flexifuel / 1.6 EcoBoost / 2.0 / 2.0 Ti-GDi / 2.0 ST / 1.5 TDCi / 1.6 TDCi / 2.0 TDCi / 2.0 TDCi ST</li>\\r\\n	<li><strong>Ford Focus MK3 Sedan:</strong> 1.0 EcoBoost / 1.5 EcoBoost / 1.6 Ti / 1.6 Flexifuel / 1.6 EcoBoost / 2.0 / 2.0 GDi / 2.0 ST / 1.5 TDCi / 1.6 TDCi / 2.0 TDCi</li>\\r\\n	<li><strong>Ford Focus MK3 Sedan Facelift:</strong> 1.0 EcoBoost / 1.5 EcoBoost / 1.6 Ti / 1.6 Flexifuel / 1.6 EcoBoost / 2.0 / 2.0 GDi / 2.0 ST / 1.5 TDCi / 1.6 TDCi / 2.0 TDCi</li>\\r\\n	<li>Ültetés mértéke elöl: 20-50mm</li>\\r\\n	<li>Ültetés mértéke hátul: 20-60mm</li>\\r\\n	<li>Első tengely terhelés: 1100kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1070kg</li>\\r\\n	<li>Rugó erősség (első, fő rugó): 60 N/mm</li>\\r\\n	<li>Rugó erősség (első, segéd rugó): 5,66 N/mm</li>\\r\\n	<li>Rugó erősség (hátsó, fő rugó): 30-84 N/mm</li>\\r\\n	<li>Rugó erősség (hátsó, segéd rugó): 20 N/mm</li>\\r\\n	<li>TÜV engedéllyel nem rendelkezik! Engedélyezése folyamatban!</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>Gáztöltéses lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><u><strong>Termék jellemzői:</strong></u></p>\\r\\n\\r\\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p> </p>\\r\\n', 'MTS-Technik by Nord Performance Ford Focus MK3, beleértve Facelift, kivéve Kombi, 2010.07-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-focus-mk3-beleertve-facelift-kiveve-kombi-2010-07-tol-street-series-allithato-magassagu-futomu'),
(668, '', '<p>A MTS-Technik által készített állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik fontosnak tartják a kiváló minőséget és kedvező árat. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>\n\n<ul>\n	<li><strong>Ford Focus MK3 Kombi:</strong> 1.0 EcoBoost, 1.6 Flexifuel, 1.6 LPG, 1.6 TDCi ECOnetic, 1.6 Ti, 2.0, 2.0 TDCi, 2.0 Ti-GDi</li>\n	<li><strong>Ford Focus MK3 Kombi Facelift:</strong> 1.0 EcoBoost, 1.5 EcoBoost, 1.5 TDCi, 1.5 TDCi ECOnetic, 1.6 Flexifuel, 1.6 LPG, 1.6 TDCi ECOnetic, 1.6 Ti, 2.0, 2.0 TDCi, 2.0 TDCi ST, 2.0 Ti-GDi</li>\n	<li>Elülső ültetés: 20-60mm</li>\n	<li>Hátsó ültetés: 30-75mm</li>\n	<li>Elülső tengely terhelése: 1090kg</li>\n	<li>Hátsó tengely terhelése: 1070kg</li>\n	<li>TÜV engedély hiányzik, engedélyezés folyamatban van</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az<strong> Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Ford Focus MK3 Kombi, beleértve Facelift, 2010.07-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-focus-mk3-kombi-beleertve-facelift-2010-07-tol-street-series-allithato-magassagu-futomu'),
(669, '', '<div>\n  <p>Ez az állítható magasságú futómű egy olyan autótípushoz készült, amely a következő jellemzőkkel rendelkezik:</p>\n  <ul>\n    <li>Autótípus: Ford Focus 3 Limousine</li>\n    <li>Tipuskód: DYB</li>\n    <li>Típus variáció: Limousine</li>\n    <li>Évjárat: 2011.04-től</li>\n    <li>Tengelyterhelés elöl (kg): 1100</li>\n    <li>Tengelyterhelés hátul (kg): 1025</li>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-50 mm, hátul: 40-55 mm között állítható.<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti értékekre vonatkozik.)</li>\n    <li>Plussz ültetés lehetőség elöl: +18 mm, hátul: +11 mm</li>\n    <li>Gyártó: Ap-Fahrwerke Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF30-058</strong></p>\n  <p><br />\n  Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Ford Focus MK3 (Typ: DYB) Sedan, 2011.04-től, (első tengely terhelés 1001-1100kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-mk3-typ-dyb-sedan-2011-04-tol-els-tengely-terheles-1001-1100kg-allithato-magassagu-futomu'),
(670, '', '<p>Ez az állítható magasságú futómű az alábbi autótípushoz illeszkedik:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autómodell: Ford Focus 3 Limousine</li>\\r\\n	<li>Tipuskód: DYB</li>\\r\\n	<li>Típus variáció: Limousine</li>\\r\\n	<li>Évjárat: 2011.04-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1000</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1025</li>\\r\\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-50 mm, hátul: 40-55 mm között szabályozható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fent említett beállításokat engedélyezi.)</li>\\r\\n	<li>Extra ültetési lehetőség elöl: +18 mm, hátul: +11 mm</li>\\r\\n	<li>Gyártva Ap-Fahrwerke Németországban</li>\\r\\n	<li>Garancia időtartama: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: GF30-057</strong></p>\\r\\n\\r\\n<p><br />\\r\\nAz ár egy szettre vonatkozik!</p>\\r\\n', 'AP made by KW Ford Focus MK3 (Typ: DYB) Sedan, 2011.04-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-mk3-typ-dyb-sedan-2011-04-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(671, '', '<div>\n  <p>Ez az állítható magasságú futómű megfelel a következő autótípusnak:</p>\n  <ul>\n    <li>Ford Focus 3 ST Limousine</li>\n    <li>Tipuskód: DYB</li>\n    <li>Típus variáció: ST Limousine</li>\n    <li>Évjárat: 2012.06-tól</li>\n    <li>Tengelyterhelés elöl (kg): 1070</li>\n    <li>Tengelyterhelés hátul (kg): 1025</li>\n    <li>Ez a futóműszett német TÜV engedéllyel rendelkezik, mely a beállításokra vonatkozik.</li>\n    <li>Ültetés mértéke elöl: 25-40 mm, hátul: 20-35 mm (a TÜV engedély csak ezen beállításokra érvényes).</li>\n    <li>Plussz ültetés lehetőség elöl: +22 mm, hátul: +20 mm</li>\n    <li>Gyártó: Ap-Fahrwerke Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszáma: GF30-059</strong></p>\n  <p>Az ár egy szettre vonatkozik.</p>\n</div>', 'AP made by KW Ford Focus ST (Typ: DYB) Sedan, 2012.06-tól, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-focus-st-typ-dyb-sedan-2012-06-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(672, '', '<p>A Vogtland állítható magasságú futómű szett kifejezetten a Ford Focus autókhoz lett tervezve, kivéve az ST típust. Az évjárat 2011 áprilisától 2014 szeptemberéig terjed, és lehetőséget biztosít az ültetés mértékének 30-50 mm-el való csökkentésére elöl, illetve 40-55 mm-el hátul. A maximális tengelyterhelés elöl 1001-1100 kg, míg hátul 1025 kg lehet. A futómű szett tartalmaz kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, ami kiegyensúlyozott komfortot és fokozott dinamikát biztosít. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, és a termék TÜV minősítéssel rendelkezik. A gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat. A termék Made in Germany, cikkszáma: 968177.</p>', 'Vogtland Ford Focus MK3 (Typ: DYB) Sedan, kivéve ST, 2011.04-2014.09-ig, (első tengely terhelés 1001-1100kg) állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk3-typ-dyb-sedan-kiveve-st-2011-04-2014-09-ig-els-tengely-terheles-1001-1100kg-allithato-magassagu-futomu'),
(673, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelelő választás lehet a 2012.6-2014.09 között gyártott Ford Focus modellekhez. Ez a minőségi futómű szett lehetővé teszi az autó megjelenésének javítását, miközben optimális vezetési élményt nyújt. A szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó stabilitásához és kényelméhez.</p>\n\n<p>Az ültetés mértéke 25-40 mm-el elöl és 20-35 mm-el hátul állítható, így mindenki saját elképzeléseinek megfelelően hangolhatja autóját. A termék rendelkezik TÜV minősítéssel, és a gyártó a rugókra és lengéscsillapítókra 2 év garanciát biztosít.</p>\n\n<p>Az alapesetben 4 db ültető rugó és 4 db lengéscsillapító található a szettben, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Ne feledd, ez a termék Made in Germany!</p>\n\n<p>Cikkszám: 968748</p>', 'Vogtland Ford Focus MK3 (Typ: DYB), csak ST, kivéve Kombi és 4WD, 2012.6-2014.09-ig  állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk3-typ-dyb-csak-st-kiveve-kombi-es-4wd-2012-6-2014-09-ig--allithato-magassagu-futomu'),
(674, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a FORD FOCUS modellekhez lett tervezve. Ez a futómű kiválóan javítja az autó megjelenését, miközben optimális vezetési élményt nyújt. Az ültetés mértéke szabadon állítható 30-50 mm-el elöl és 40-55 mm-el hátul. Ez a minőségi futómű szett magában foglalja a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózió elleni védelemmel rendelkező lengéscsillapítók hozzájárulnak az autó kiváló vezethetőségéhez.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Az említett futómű szett a Made in Germany minőséget képviseli, és cikkszáma: 968176.</p>', 'Vogtland Ford Focus MK3 (Typ: DYB) Sedan, kivéve ST, 2011.04-2014.09-ig, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-ford-focus-mk3-typ-dyb-sedan-kiveve-st-2011-04-2014-09-ig-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(675, '', '<strong>Ford Focus MK3 Bilstein B14 állítható magasságú futómű</strong></p>\n<ul>\n	<li>A Bilstein egycsöves rendszer innovatív Upside-Down technológiával</li>\n	<li>Ver­sény­sport­ru­gók kiváló minőségű anyagokból</li>\n	<li>Állítható magasságú futómű, alumínium rugótányér és kontra anya felhasználásával</li>\n</ul>\n<p>A Bilstein B14 futómű a versenysport technológiát hozza az utakra. A B14 PSS lehetőséget nyújt a jármű magasságának csökkentésére akár 50 mm-rel az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</p>', 'Bilstein Ford Focus MK3, kivéve 2.0 ST, 2011.04-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-ford-focus-mk3-kiveve-2-0-st-2011-04-tol-bilstein-b14-allithato-magassagu-futomu'),
(676, '', '<strong>Állítható magasságú futómű a Ford Focus MK3-hoz BILSTEIN B14</strong></p>  <p> </p>  <ul> 	<li>BILSTEIN egyhengeres rendszer</li> 	<li>Invertált technológiával</li> 	<li>Versenysport rugók magas szilárdságú anyagból</li> 	<li>Magasság állítási lehetőség (alumíniumból készült rugótányér és kontra anya)</li> </ul>  <p>A BILSTEIN mérnökei a versenysport technológiát az utcára hozzák a B14-gyel, amely nagy előnyt nyújt. A B14 PSS-nél a jármű magassága az első és hátsó tengelyen maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. A B14 PSS egyhengeres invertált technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben.</p>', 'Bilstein Ford Focus MK3, 2.0 ST, 2012.07-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-ford-focus-mk3-2-0-st-2012-07-tol-bilstein-b14-allithato-magassagu-futomu'),
(677, '', '<p><strong>Állítható magasságú futómű a Ford KA Jom Blueline modellhez</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Típus: RU</li>\\r\\n	<li>Motor: 1.2, 1.3TDCi</li>\\r\\n	<li>Rövidített satbilizátor rúd szükséges a telepítéshez. A szett nem tartalmazza ezt az elemet.</li>\\r\\n	<li>Első tengely terhelés: 830kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 740kg alatt</li>\\r\\n	<li>Elülső ültetés mértéke: 30 - 60 mm</li>\\r\\n	<li>Hátsó ültetés mértéke: 10 - 30 mm</li>\\r\\n	<li>A futómű megfelel a TÜV előírásainak és rendelkezik az engedéllyel.</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Ford KA (Typ: RU), 1.2, 1.3TDCi, 2008-tól állítható magasságú futómű', '', '', '', 'jom-bochum-ford-ka-typ-ru-1-2-1-3tdci-2008-tol-allithato-magassagu-futomu'),
(678, '', '<strong>Állítható magasságú futómű a Ford KA V-Maxx modellhez</strong><br />Modell: RU<br />Motorok: 1.2, 1.3TDCi<br />Az autó stabilitásának növelése érdekében javasolt rövidített stabilitásjavító rúd beszerzése, ami nem tartozék a készlethez.<br />Az ültetés mértéke az első tengelyen: 30 - 70 mm<br />Az ültetés mértéke a hátsó tengelyen: 30 - 60 mm<br />Ez a termék rendelkezik TÜV engedéllyel.', 'V-Maxx Ford KA (Typ: RU), 1.2, 1.3TDCi, 2008-tól állítható magasságú futómű', '', '', '', 'v-maxx-ford-ka-typ-ru-1-2-1-3tdci-2008-tol-allithato-magassagu-futomu'),
(679, '', '<strong>Fiat 500 MTS-Technik Street állítható magasságú sport futómű</strong></p>\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választások olyan vásárlók számára, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális egyensúly van a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható legtöbb esetben 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u>Termék karakterisztika:</u></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Ford KA (Typ: RU), 1.2, 1.3TDCi, 2008.12-2016.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-ka-typ-ru-1-2-1-3tdci-2008-12-2016-07-ig-street-series-allithato-magassagu-futomu'),
(680, '', '<p>A Vogtland állítható magasságú futómű szett FORD KA modellekhez 2009. februártól. Ez a speciális futómű szett lehetővé teszi az autó alacsonyabbra ültetését 30-60 mm-el elöl és 10-40 mm-el hátul. A Ford Ka, Typ RU8 típusú autókhoz tervezett szett maximális tengelyterhelése elöl 830 kg, míg hátul 640 kg. </p> \n<p>Ez a futómű nemcsak javítja az autó megjelenését, hanem kiváló vezetési élményt is biztosít. Az ültetés mértékét a felhasználó igényeinek megfelelően lehet beállítani. A kitűnő minőségű futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát nyújtanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyekhez szintező vagy torziós futóművet szereltek.</p>\n<p>Made in Germany!</p>', 'Vogtland Ford KA (Typ: RU8), 2009.02-től állítható magasságú futómű', '', '', '', 'vogtland-ford-ka-typ-ru8-2009-02-tol-allithato-magassagu-futomu'),
(681, '', '<p><strong>Ford Mondeo MK3 MTS-Technik Street</strong> sport futómű</p>\n<ul>\n	<li><strong>Ford Mondeo MK3 Turnier</strong> különböző motorváltozatokhoz</li>\n	<li>Első tengely terhelése: 1200 kg</li>\n	<li>Hátsó tengely terhelése: 1150 kg</li>\n	<li>Elülső ültetés mértéke: 25 - 80 mm</li>\n	<li>Hátsó ültetés mértéke: 30 - 70 mm</li>\n	<li>Rugó erőssége (elülső fő és segédrugó): 70 N/mm, 20 N/mm</li>\n	<li>Rugó erőssége (hátsó fő rugó): 28,1 - 60 N/mm</li>\n	<li>TÜV engedély</li>\n</ul>\n<p>Az MTS-Technik Street sport futóművei kiváló választás azoknak, akik minőségi és megfizethető terméket keresnek! A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az optimális rugók és lengéscsillapítók egyensúlya biztosítja a kiváló teljesítményt.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Plug & play készlet, nincs szükség módosításra az autó felfüggesztésében</li>\n</ul>\n<p><u>Termék karakterisztika:</u></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Ford Mondeo MK3 Turnier, 2000.10-2007.03-ig, (első tengely terhelés 1200kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-mondeo-mk3-turnier-2000-10-2007-03-ig-els-tengely-terheles-1200kg-alatt-street-series-allithato-magassagu-futomu'),
(682, '', '<strong>Ford Mondeo MK3 MTS-Technik Street állítható magasságú sport futómű</strong><br /><br /> Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A futómű magasságát könnyedén szabályozhatjuk az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók között optimális egyensúly van.<br /><br /><u>Termékjellemzők:</u><br /><br /> Az Eibach által gyártott rugók szabadon állíthatók általában 25 és 80 mm között. A gáztöltésű lengéscsillapítók magas hatékonyságot biztosítanak extrém körülmények között is. A két rétegű bevonat védi az alkatrészeket a korróziótól. A futómű tökéletes egyensúlyt teremt a rugók és a lengéscsillapítók között, és könnyen telepíthető módosítások nélkül.<br /><br /><u>Termék karakterisztika:</u><br /><br /><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" style=\\\"height:314px; width:400px\\\" /><br /><br /><em>A honlap szöveges és képi anyagainak jogvédett másolása tilos!</em>', 'MTS-Technik by Nord Performance Ford Mondeo MK3 Sedan és Liftback, 2000.10-2007.09-ig, (első tengely terhelés 1200kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-mondeo-mk3-sedan-es-liftback-2000-10-2007-09-ig-els-tengely-terheles-1200kg-alatt-street-series-allithato-magassagu-futomu'),
(683, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípusnak:</p>\n<ul>\n	<li>Ford Mondeo Limousine és Liftback modellekhez</li>\n	<li>Tipuskód: B4Y, B5Y</li>\n	<li>Típusváltozat: Limousine, ideértve az ST220-ast is</li>\n	<li>Évjárat: 2000.11-től</li>\n	<li>Tengelyterhelés elöl (kg): 1175</li>\n	<li>Tengelyterhelés hátul (kg): 1015</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel! <strong><a href=\"https://www.ap.de/documents/gaAPGFW30-016_1047-11.pdf\"><span>Letöltés</span></a></strong></li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li>\n	<li>Plusz ültetés lehetőség elöl: +10 mm, hátul: +30 mm</li>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>', 'AP made by KW Ford Mondeo (Typ: B4Y, B5Y) Sedan és Liftback, beleértve ST220, 2000.10-2007.03-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-mondeo-typ-b4y-b5y-sedan-es-liftback-beleertve-st220-2000-10-2007-03-ig-allithato-magassagu-futomu'),
(684, '', '<p>Ez az állítható magasságú futómű a Ford Mondeo Turnier, ST220 típushoz passzol.</p>\n\n<ul>\n	<li>Tipuskód: BWY</li>\n	<li>Évjárat: 2000.11-től</li>\n	<li>Tengelyterhelés elöl (kg): 1200</li>\n	<li>Tengelyterhelés hátul (kg): 1150</li>\n	<li>Egyéb információk: Az első futómű magassága állítható, míg a hátsó futómű fix. A szett tartalmazza a hátsó ültetőrugókat és a lengéscsillapítókat is. A beültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n	<li>Az engedélyben meghatározott beültetés mértéke elöl: 35-65 mm, hátul: kb. 40 mm között állítható (bár nagyobb intervallumban is beállítható a futómű, a TÜV engedély csak a fent említett beállításokra vonatkozik).</li>\n	<li>Lehetséges további beültetés elöl: +10 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>', 'AP made by KW Ford Mondeo (Typ: BWY) Turnier, beleértve ST220, 2000.11-2007.03-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-mondeo-typ-bwy-turnier-beleertve-st220-2000-11-2007-03-ig-allithato-magassagu-futomu'),
(685, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett célja a FORD MONDEO modellek, kifejezetten az 2000-2007 évek között gyártott típusok, mint például a Ford Mondeo, Typ BWY, Turnier, ST220, teljesítményének optimalizálása. A futómű kitűnő választás a jármű megjelenésének javítása mellett, mivel maximális vezetési élményt biztosít. Az ültetés mértéke 20 - 45 / 25 mm között állítható, lehetővé téve számodra, hogy saját elképzelésed szerint finomhangold az autód magasságát.</p>\n\n<p>Ez a minőségi futómű szett exkluzív kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerük révén kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autód tartósságához és teljesítményéhez.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát nyújt az ültető rugókra és lengéscsillapítókra. A szett alapesetben 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968070</p>', 'Vogtland Ford Mondeo Turnier ST220, ST220, 2000.11-től állítható magasságú futómű', '', '', '', 'vogtland-ford-mondeo-turnier-st220-st220-2000-11-tol-allithato-magassagu-futomu'),
(686, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett a FORD MONDEO modellekhez készült. Az évek 2000 és 2007 közötti gyártási időszakra tervezve lett. Ennek a futómű szettnek az ültetését 35-65 / 40 mm között lehet állítani. A típusok, amelyekhez kompatibilis: Ford Mondeo, Typ BWY, Turnier. Az elülső tengely maximális terhelése 1200 kg, míg a hátsó tengelyé 1150 kg.</p>\n\n<p>Ez a futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. A beállítások lehetőséget adnak az ültetés személyre szabására. A csomag magas teljesítményű, kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>\n\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más típusú futóművel rendelkeznek, például szintezős vagy torziós futóművel.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968004</p>', 'Vogtland Ford Mondeo (Typ: BWY) Turnier, 2001.03-2007.03-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-mondeo-typ-bwy-turnier-2001-03-2007-03-ig-allithato-magassagu-futomu'),
(687, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a FORD MONDEO típusú autókhoz, melyek gyártási éve 2000-2007 közötti időszakra esik. A futómű beállítási lehetőségei 35-65 mm között mozognak, és alkalmasak a Ford Mondeo B4Y, B5Y típusú Limuzin/Sedan modellekre. Az elülső tengely maximális terhelése 1175 kg, míg a hátsó tengelyé 1015 kg.</p> <p>Ez a kiváló minőségű futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az állítható ültetés lehetőségei segítségével személyre szabottan alakítható az autó magassága. A kétcsöves lengéscsillapítók alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968005</p>', 'Vogtland Ford Mondeo (Typ: B4Y, B5Y) Sedan, 2000.11-2007.03-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-mondeo-typ-b4y-b5y-sedan-2000-11-2007-03-ig-allithato-magassagu-futomu'),
(688, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a FORD MUSTANG 2015-től gyártott modellekhez. Ez a speciális futómű kitűnő lehetőséget biztosít arra, hogy testreszabott módon állítsd az autó ültetését 30-50 mm-el elöl és 20-40 mm-el hátul. A kiváló minőségű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, így optimális kényelmet és dinamizmust biztosítanak. Emellett kiváló korrozív ellenállással rendelkeznek.</p>\n\n<p>Ez a TÜV minősítéssel ellátott termék 2 év garanciával rendelkezik, és tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve a szintezős vagy torziós futóművel szerelt autók esetében. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, így Made in Germany minőséget garantál.</p>\n\n<p>Cikkszám: 968771</p>', 'Vogtland Ford Mustang (Typ: LAE) S550, beleértve Cabrio, 2015.03-tól állítható magasságú futómű', '', '', '', 'vogtland-ford-mustang-typ-lae-s550-beleertve-cabrio-2015-03-tol-allithato-magassagu-futomu'),
(689, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelel a FORD MUSTANG 2005-2014 évi modellekhez. Az ültetés mértéke 30-60 / 35-55 mm között állítható, és kompatibilis a Ford Mustang S197 V6 és V8 típusokkal (kivéve a Shelby GT500-at). A futómű max. tengelyterhelése elöl 1134 kg, hátul pedig 1100 kg. </p>\n\n<p>Ez a minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók maximális vezetési élményt nyújtanak, miközben javítják az autó megjelenését.</p>\n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugó gyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet használnak.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968619</p>', 'Vogtland Ford Mustang, V6, V8, kivéve Shelby GT500, 2005-2014-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-mustang-v6-v8-kiveve-shelby-gt500-2005-2014-ig-allithato-magassagu-futomu'),
(690, '', 'Az említett alkatrész kompatibilis a Ford Mustang Coupe Typ S197 modellekkel, melyek 2005 és 2014 közötti gyártásúak. A csomag tartalmazza a komplett állítható futóművet, amely magában foglal egy szett futóművet és két kulcsot. Ez a német gyártmányú FK AK Street Állítható Magasságú Futómű kiváló minőségű FK versenysport rugókból és FK gyártmányú sport lengéscsillapítókból áll. A gyártás minőségét tanúsítja a DIN EN ISO 9001-2001 minősítés. Minden FK futómű rendelkezik TÜV engedéllyel. Az FK AK Street állítható magasságú futóműnél a rugó és a lengéscsillapító autóspecifikus összehangoltsága biztosítja a kiváló kanyarstabilitást és biztonságot sportos vezetés közben. Az állítás fokozatmentesen 30-60 cm közötti intervallumban végezhető el a LENGÉSCSILLAPÍTÓHÁZ-on elhelyezett állítóanyak segítségével.', 'FK-Automotive Ford Mustang V Coupé (Typ: S197), 2004.12-2014.01-ig állítható magasságú futómű', '', '', '', 'fk-automotive-ford-mustang-v-coupe-typ-s197-2004-12-2014-01-ig-allithato-magassagu-futomu'),
(691, '', '<p><strong>MTS-Technik Street Series állítható magasságú tuning sportfutómű</strong></p>  \n<ul>  \n	<li><strong>Ford Mustang Coupé, </strong>3.7 / 4.0 V6 / 4.6 V8 / 5.0 / 5.4 V8 / 5.4</li>  \n	<li>Évjárat: 2004.12-2014.01-ig</li>  \n	<li>Típus: S197</li>  \n	<li>Ültetés mértéke elõl: 25-60mm</li>  \n	<li>Ültetés mértéke hátul: 30-60mm</li>  \n	<li>Elsõ tengely terhelés: 1070kg</li>  \n	<li>Hátsó tengely terhelés: 1116kg</li>  \n	<li>TÜV engedéllyel rendelkezik</li>  \n</ul>  \n<p>Az MTS-Technik által kifejlesztett állítható magasságú sportfutóművek kiváló választás azoknak, akik számára fontos a minőség és az ár-érték arány. A futóművek fokozatmentesen állítható magassága lehetővé teszi, hogy az autó hasmagassága könnyedén igazítható legyen az útviszonyokhoz. Az MTS-Technik futóműveiben optimális egyensúly van a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>  \n	<li>gáztöltetű lengéscsillapítók</li>  \n	<li>kiemelkedő hatékonyság extrém igénybevétel mellett is</li>  \n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>  \n</ul>  \n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Ford Mustang V Coupé (Typ: S197), 2004.12-2014.01-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-mustang-v-coupe-typ-s197-2004-12-2014-01-ig-street-series-allithato-magassagu-futomu'),
(692, '', '<p><strong>Ford USA Mustang Coupé MTS-Technik Street Series állítható magasságú tuning sportfutómû</strong></p>  <ul> 	<li><strong>Ford Mustang Coupé, </strong>3.7 / 4.0 V6 / 4.6 V8 / 5.0 / 5.4 V8 / 5.4</li> 	<li>Évjárat: 2004.12-2014.01-ig</li> 	<li>Típus: S197</li> 	<li>Ültetés mértéke elõl: 25-60mm</li> 	<li>Ültetés mértéke hátul: 30-60mm</li> 	<li>Elsõ tengely terhelés: 1070kg</li> 	<li>Hátsó tengely terhelés: 1116kg</li> 	<li>TÜV engedéllyel rendelkezik</li> </ul>  <p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azoknak, akik számára fontos a minőség és az ár-érték arány! A magasság könnyedén beállítható az útviszonyoknak megfelelően, így az autó hasmagassága fokozatmentesen változtatható. Az MTS-Technik futóműveiben ideális az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja.</li> 	<li>A magasság szinte bármikor 25 és 80 mm között szabadon állítható.</li> 	<li>Gáztöltésű lengéscsillapítók.</li> 	<li>Kiemelkedő hatékonyság extrém igénybevételek mellett is.</li> 	<li>A hosszantartó korrózióvédelem érdekében két rétegű bevonat (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között.</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Ford Mustang V Cabrio (Typ: S197), 2005.09-2014.01-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-mustang-v-cabrio-typ-s197-2005-09-2014-01-ig-street-series-allithato-magassagu-futomu'),
(693, '', '<p>Ez az állítható magasságú futómű passzol az alábbi autótípushoz:</p>\n\n<ul>\n	<li>Ford Puma hátsó villás végződésű gátlóval</li>\n	<li>Tipuskód: ETC</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1997.03 - 1998</li>\n	<li>Tengelyterhelés elöl (kg): 770</li>\n	<li>Tengelyterhelés hátul (kg): 670</li>\n	<li>Egyéb kitételek: Csak olyan modellekhez, ahol a hátsó lengéscsillapítók villás kialakításúak.</li>\n</ul>\n\n<ul>\n	<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-75 mm, hátul: 35-75 mm között állítható<br />(A futómű nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>Plusz ültetés lehetőség elöl: +30 mm, hátul: +30 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11530003</p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Ford Puma (Typ: ETC), hátul villás felfogatás, 1997.03-1998-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-puma-typ-etc-hatul-villas-felfogatas-1997-03-1998-ig-allithato-magassagu-futomu'),
(694, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómű kompatibilis a következő autótípussal:</p>\n\n<ul>\n	<li>Ford Puma hátsó szemes végződésű gátlóval</li>\n	<li>Tipuskód: ETC</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1999-től</li>\n	<li>Tengelyterhelés elöl (kg): 770</li>\n	<li>Tengelyterhelés hátul (kg): 670</li>\n	<li>Egyéb kitételek: Csak olyan modellekhez alkalmas, amelyek hátsó lengéscsillapítói szemes kialakításúak.</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetési tartomány elöl: 35-75 mm, hátul: 35-75 mm között állítható<br />\n	(Minden esetben nagyobb tartományban is állítható a futómű, de a TÜV engedély csak a fent említett beállításokra érvényes.)</li>\n	<li>Plusz ültetési lehetőség elöl: +30 mm, hátul: +30 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártva Ap-Fahrwerke Németországban</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11530013</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Ford Puma (Typ: ETC), hátul szemes felfogatás, 1999-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-ford-puma-typ-etc-hatul-szemes-felfogatas-1999-tol-allithato-magassagu-futomu'),
(695, '', '<strong>Vogtland</strong> állítható magasságú futómű szett kifejezetten a FORD PUMA típushoz. Az évjárat 1997-1998 közötti, az ültetés mértéke 35-75 / 35-75 mm lehet. A hátsó lengéscsillapító villás rögzítésű. Az elülső tengelyterhelés maximuma 770 kg, míg a hátsóé 670 kg. A szett engedélyezett és a hozzá tartozó dokumentáció elérhető <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW300GF03-13_1486-10.pdf\\\" target=\\\"_blank\\\">itt</a>.\n\nEz a minőségi futómű szett exkluzív kétcsöves lengéscsillapítókat tartalmaz, melyek kiváló kényelmet és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak, így hosszú távon is kiváló teljesítményt nyújtanak.\n\nA termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.\n\nA szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.\n\nMade in Germany!\n\nCikkszám: 968334', 'Vogtland Ford Puma (Typ: ETC), hátul villás felfogatás, 1997.03-1998-ig állítható magasságú futómű', '', '', '', 'vogtland-ford-puma-typ-etc-hatul-villas-felfogatas-1997-03-1998-ig-allithato-magassagu-futomu'),
(696, '', '<p><strong>Vogtland</strong> általános állítható magasságú futómű szett a FORD PUMA modellekre.</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1999-től</li>\n	<li><strong>Ültetés mértéke</strong>: 35 - 75 mm</li>\n	<li><strong>Típus</strong>: Ford Puma, Typ ECT, hátsó lengéscsillapító szemes rögzítéssel</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 770 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 670 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW300GF03-13_1486-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW300GF03-13_1486-10.pdf</a></li>\n</ul>\n<p>A Vogtland futómű szett a Ford Puma modellekhez, mely javítja az autó megjelenését és biztosítja a maximális vezetési élményt. Az ültetés mértékét az egyéni igények szerint állíthatja. A kit csak speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett tartalma általában 4 db ültető rugó és 4 db lengéscsillapító, kivéve azoknál az autótípusoknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968335</p>', 'Vogtland Ford Puma (Typ: ETC), hátul szemes felfogatás, 1999-től állítható magasságú futómű', '', '', '', 'vogtland-ford-puma-typ-etc-hatul-szemes-felfogatas-1999-tol-allithato-magassagu-futomu'),
(697, '', '<strong>Ford Transit Courier járművekhez állítható futómű</strong><br /><ul><li>Típus: Ford Transit Courier</li><li>Csak Facelift</li><li>Évjárat: 2014.02-től</li><li>Motor: 1.0 EcoBoost, 1.5TDCi, 1.6TDCi</li><li>A beszereléshez állítható stabilizátor rúd szükséges, cikkszám: SBM0</li><li>Elülső ültetés mértéke: 25-60mm</li><li>Hátsó ültetés mértéke: 50-80mm</li><li>24 hónap garancia</li><li>A futómű megfelel a TÜV előírásainak</li></ul><br /><p>Szerelési útmutató elérhető itt: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/109.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/109.pdf</a></p><br /><p>TÜV engedély részletei: <a href=\\\"https://www.v-maxx.com/files/TUV/60%20FO%2017.pdf\\\">https://www.v-maxx.com/files/TUV/60%20FO%2017.pdf</a></p>', 'V-Maxx Ford Transit Courier (Typ: JN8), 1.0 EcoBoost, 1.5TDCi, 1.6TDCi, 2014.02-től állítható magasságú futómű', '', '', '', 'v-maxx-ford-transit-courier-typ-jn8-1-0-ecoboost-1-5tdci-1-6tdci-2014-02-tol-allithato-magassagu-futomu'),
(698, '', '<p>Egy állítható magasságú sport futómű, amely ideális választás azoknak, akik minőségi terméket kedvező áron szeretnének vásárolni. Ennek a futóműnek a magassága fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimalizált rugó- és lengéscsillapító rendszerrel rendelkeznek.</p>\n\n<p><u>Alkalmazható típusok:</u></p>\n\n<ul>\n	<li>Ford Transit Connect (Typ: V408), 1.0 EcoBoost / 1.6 EcoBoost / 2.0 GDi / 2.5 Duratec / 1.5 EcoBlue / 1.5 TDCi / 1.6 TDCi</li>\n	<li>Ültetés mértéke elöl: 40-70mm</li>\n	<li>Ültetés mértéke hátul: 80-110mm</li>\n	<li>Első tengely terhelés: 1270kg</li>\n	<li>Hátsó tengely terhelés: 1355kg</li>\n	<li>Rugó erősség (első, fő rugó): 70 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 5 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 70 N/mm</li>\n	<li>Rugó erősség (hátsó, segéd rugó): 5 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel! Engedélyezés folyamatban!</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszútávú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>\n\n<p> </p>\n\n<p> </p>', 'MTS-Technik by Nord Performance Ford Transit Connect (Typ: V408), 2013.02-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-ford-transit-connect-typ-v408-2013-02-tol-street-series-allithato-magassagu-futomu'),
(699, '', 'A Ford Transit Custom számára elérhető egy futómű, melynek magassága és keménysége módosítható. Ez a futómű csak a Facelift verzióhoz készült, gyártási éve 2014.09-től. A hajtásért felelős motorok lehetnek 2.0TDCi és 2.2TDCi. Fontos megjegyezni, hogy ez a futómű csak laprugós változatokhoz ajánlott, ezért mindenképp ellenőrizd a rendelés előtt! Az elülső ültetés mértéke 20-30mm, míg a hátsó ültetés mértéke 50-60mm lehet. A futómű keménysége állítható 20 fokozatban, és 24 hónap garanciával rendelkezik. TÜV engedéllyel is szolgál. Ha szeretnéd felszerelni, használd az alábbi szerelési útmutatót: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/130.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/130.pdf</a>. További információkért a TÜV engedélyről kattints ide: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20FO%2030.pdf\\\">https://www.v-maxx.com/files/TUV/70%20FO%2030.pdf</a>.', 'V-Maxx Ford Transit Custom (Typ: FCC, FAC) Facelift, 2.0TDCi, 2.2TDCi, 2014.09-től, (laprugó szélessége 60mm), állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-ford-transit-custom-typ-fcc-fac-facelift-2-0tdci-2-2tdci-2014-09-tol-laprugo-szelessege-60mm-allithato-kemenysegu-allithato-magassagu-futomu'),
(700, '', '<div>A Ford Transit Customhoz kifejlesztett futóműveink lehetővé teszik az állítható magasságot és keménységet. Kizárólag a Facelift változatokhoz terveztük őket, az 2014.09-től gyártott modellekhez. A futóművek kompatibilisek a 2.0TDCi és 2.2TDCi motorokkal, valamint csak 75mm széles laprugóval szerelt modellekhez ajánljuk őket. Kérjük, ellenőrizd a kompatibilitást rendelés előtt!</div>\n<div>Elülső ültetés esetén 20-30mm-tel, míg hátsó ültetésnél 50-60mm-tel állítható magasságot biztosítanak. A futómű keménysége 20 fokozatban állítható, így mindenki megtalálhatja a számára ideális beállítást. A termékekre 24 hónapos garanciát vállalunk, emellett rendelkeznek TÜV engedéllyel is.</div>\n<div>A futóművek könnyen telepíthetők a mellékelt szerelési útmutató alapján. További információkért látogass el a <a href=\"https://www.v-maxx.com/files/INST.INSTRUCTIES/130.pdf\">szerelési útmutató oldalára</a>, illetve tekintsd meg a <a href=\"https://www.v-maxx.com/files/TUV/70%20FO%2030.pdf\">TÜV engedélyt itt</a>.</div>', 'V-Maxx Ford Transit Custom (Typ: FCC, FAC) Facelift, 2.0TDCi, 2.2TDCi, 2014.09-től, (laprugó szélessége 75mm), állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-ford-transit-custom-typ-fcc-fac-facelift-2-0tdci-2-2tdci-2014-09-tol-laprugo-szelessege-75mm-allithato-kemenysegu-allithato-magassagu-futomu'),
(701, '', '<div>\n	<p>Ez a <strong>Állítható magasságú futómû</strong> alkalmas a következõ autótípusra:</p>\n	<ul>\n		<li>Honda Accord</li>\n		<li>Tipuskód: CL7, CL9, CN1</li>\n		<li>Típus variáció:</li>\n		<li>Évjárat: 2003.01-tõl</li>\n		<li>Tengelyterhelés elöl (kg): 1080</li>\n		<li>Tengelyterhelés hátul (kg): 920</li>\n		<li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li>\n		<li>Az engedély által meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br />(Az állítási intervallum ennél nagyobb is lehet, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li>\n		<li>Plussz ültetés lehetõség elöl: +70 mm, hátul: +45 mm</li>\n		<li>Gyártva: Ap-Fahrwerke Németország</li>\n		<li>Garancia: 2 év</li>\n	</ul>\n	<p><strong>Cikkszám: </strong>11550009</p>\n	<p><br />\n	Az ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Honda Accord (Typ: CL7, CL9, CN1), 2003.01-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-accord-typ-cl7-cl9-cn1-2003-01-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(702, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az megfizethető ár. A futómű könnyedén állítható a útviszonyoknak megfelelően, így biztosítva a megfelelő hasmagasságot. Az MTS-Technik futóműveiben optimális összhang van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz megfelelő:</u></p>\n\n<ul>\n	<li><strong>Honda Accord, </strong>2.0 (CL7) / 2.2 i-CTDi (CN1) / 2.4 (CL9)</li>\n	<li>Évjárat: 2003.01-2012.09-ig</li>\n	<li>Ültetés mértéke elöl: 10-70mm</li>\n	<li>Ültetés mértéke hátul: 10-70mm</li>\n	<li>Első tengely terhelés: 1080kg</li>\n	<li>Hátsó tengely terhelés: 920kg</li>\n	<li>TÜV engedélyeztetése folyamatban</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>a rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>az állítható magasság 25 és 80 mm között szabadon beállítható</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém körülmények között is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>tökéletes egyensúly a rugók és lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást a jármű felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Honda Accord (Typ: CL7, CL9), 2003.01-2009.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-honda-accord-typ-cl7-cl9-2003-01-2009-12-ig-street-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(703, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár! A magasság fokozatmentesen szabályozható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően! Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>a futómű rugóit az Eibach gyártja</li> <li>a magasság állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém körülmények között is</li> <li>a hosszú élettartam érdekében két rétegű bevonat (sárga cink és fekete anodyzált alumínium alkatrészek)</li> <li>ideális egyensúly a rugók és a lengéscsillapítók között</li> <li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Honda Civic (Typ: EC, ED, EE) Hatchback, 1.3, 1.3 16V, 1.4, 1.5 16V, 1.6 16V, 1.6 16V Vtec, 1987.09-1993.10-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-honda-civic-typ-ec-ed-ee-hatchback-1-3-1-3-16v-1-4-1-5-16v-1-6-16v-1-6-16v-vtec-1987-09-1993-10-ig-allithato-magassagu-futomu'),
(704, '', '<p>A MTS-Technik által készített sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az elérhető árakat. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén igazíthatók az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát kínálják.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Honda Civic (Typ: ED) Sedan, 1.3, 1.4, 1.5 16V, 1.6 16V, 1987.09-1993.10-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-honda-civic-typ-ed-sedan-1-3-1-4-1-5-16v-1-6-16v-1987-09-1993-10-ig-allithato-magassagu-futomu'),
(705, '', '<div>\n<p>A Honda Civic GF50-001 modellhez elérhető állítható futómű lehetőséget biztosít, melynek segítségével könnyedén szabályozható a jármű magassága. Ez a tuning futómű, melynek típusa AP futómű, ideális választás lehet sportosabb megjelenés vagy jobb teljesítmény eléréséhez. A futómű tuning során a jármű ültetése is szabályozható, valamint a gewinde beállítás is lehetséges.</p>\n</div>', 'AP made by KW Honda Civic, CRX, Coupé (Typ: ED, EC, EE), 1989-1992.06-ig, AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-crx-coupe-typ-ed-ec-ee-1989-1992-06-ig-ap-allithato-magassagu-futomu'),
(706, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: HONDA CIVIC</p>  <ul> 	<li><strong>Évjárat</strong>: 1989-1992</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 70 / 30 - 70 mm</li> 	<li><strong>Típus</strong>: Honda Civic, CRX, Coupé, Typ EC8, 9, ED2-4, 6, 7, 9, EE8, 9</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 850 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 770 kg</li> </ul>  <p>A futómű készlet nemcsak esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is fokozza. Az ültetés mértékét személyre szabhatja az optimális beállítások között. Ez a kiváló minőségű futómű szett exkluzív, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek a gáznyomású rendszernek köszönhetően kiegyensúlyozott komfortérzetet és dinamikus vezetést biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A futóműszett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintező- vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968336</p>', 'Vogtland Honda Civic, CRX, Coupé, 1989-1992.06-ig állítható magasságú futómű', '', '', '', 'vogtland-honda-civic-crx-coupe-1989-1992-06-ig-allithato-magassagu-futomu'),
(707, '', '<strong>Állítható magasságú sport futómű a Honda Civic FK Automotive számára</strong></p>\\r\\n\\r\\n<p>Ez a futómű kifejezetten tervezve lett az EG2, EG3, EG4, EG5, EG6, EG8, EG9, EH6, EH9, EJ1, EJ2 / EK1, EK3, EK4, EJ6, EJ8, EJ9 típuskódú Honda Civic modellekhez, az években 1991 és 2000.</p>\\r\\n\\r\\n<p>Az elő tengely maximális terhelése 860 kg, míg a hátsó tengelyénél ez az érték 820 kg.</p>\\r\\n\\r\\n<p>Ez a futómű készült Németországban, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban találsz.</p>\\r\\n\\r\\n<p>A termék teljes körű 1 éves garanciával érkezik, és kiváló minőséget kínál hihetetlenül jó áron.</p>\\r\\n\\r\\n<p>A futómű szett tartalmaz 4 lengéscsillapítót a hozzájuk tartozó rugókkal, valamint egy kulcsot az állításhoz.</p>\\r\\n', 'FK-Automotive Honda Civic, 1991-2000-ig állítható magasságú futómű', '', '', '', 'fk-automotive-honda-civic-1991-2000-ig-allithato-magassagu-futomu'),
(708, '', '<div>\n<div>\nCsak a Honda Civic V-Maxx modellhez készült sport futómű rendelkezik állítható magassággal.', 'V-Maxx Honda Civic, 1.3, 1.4, 1.5, 1.6 ESi, kivéve 5 ajtós, 1991.07-1995.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-honda-civic-1-3-1-4-1-5-1-6-esi-kiveve-5-ajtos-1991-07-1995-09-ig-allithato-magassagu-futomu'),
(709, '', '<div>\\n<p><em>Unikális méretű sport futómű a Honda Civic modellekhez</em></p>\\n</div>', 'V-Maxx Honda Civic, kivéve 5 ajtós, 1995.10-2001.02-ig állítható magasságú futómű', '', '', '', 'v-maxx-honda-civic-kiveve-5-ajtos-1995-10-2001-02-ig-allithato-magassagu-futomu'),
(710, '', '<p>Az MTSTEchnik Comfort Series állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik számára fontos a sportos megjelenés és az utazási kényelem. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTSTEchnik Comfort futóművei kiváló összhangban vannak az Eibach rugókkal és az MTSTEchnik lengéscsillapítókkal.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort Series kialakításánál nem a extrém ültetés, hanem a magas kényelem volt a fókuszban</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Honda Civic, 1991-2000-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-honda-civic-1991-2000-ig-comfort-series-allithato-magassagu-futomu'),
(711, '', '<div>\\nA Honda Civic V-Maxx modellekhez kifejlesztett sport futómű egy olyan változtatható magasságú rendszer, amely segít optimalizálni az autó teljesítményét és vezethetőségét.\\n</div>', 'V-Maxx Honda Civic, Crx, Del Sol, 1.6 V-Tec, 1.6 VTi, kivéve 5 ajtós, 1991.07-1995.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-honda-civic-crx-del-sol-1-6-v-tec-1-6-vti-kiveve-5-ajtos-1991-07-1995-09-ig-allithato-magassagu-futomu'),
(712, '', '<div>\n  Az állítható magasságú sport futómű lehetővé teszi a Honda Civic V-Maxx jármű magasságának szabályozását.\n</div>', 'V-Maxx Honda Civic, 1.6 VTi, kivéve 5 ajtós, 1995.10-2001.02-ig állítható magasságú futómű', '', '', '', 'v-maxx-honda-civic-1-6-vti-kiveve-5-ajtos-1995-10-2001-02-ig-allithato-magassagu-futomu'),
(713, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport állítható futóművei optimális egyensúlyt teremtenek az Eibach rugók és MTS-Technik lengéscsillapítók között, így maximális vezetési élményt nyújtanak széles ültetési tartományban.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók sportos teljesítményhez</li>\n	<li>A Sport Series célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>Plug & play készlet, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Honda Civic, 1991-2000-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-honda-civic-1991-2000-ig-sport-series-allithato-magassagu-futomu'),
(714, '', '<p>Ez a rugózási rendszer az alábbi autótípusokhoz ajánlott:</p>\n\n<ul>\n	<li>Honda Civic, CRX</li>\n	<li>Tipuskód: EG2-6,8,9, EH6,9, EJ1,2</li>\n	<li>Évjárat: 1992.05 - 1995.09</li>\n	<li>Tengelyterhelés elöl (kg): 840</li>\n	<li>Tengelyterhelés hátul (kg): 750</li>\n	<li>Egyéb kitételek: Csak olyan modellekhez való, amelyek hátsó lengéscsillapítói villás kialakításúak.</li>\n</ul>\n\n<ul>\n	<li>Ez a futómű összeállítás rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-75 mm, hátul: 40-75 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti beállításokkal érvényes.)</li>\n	<li>Plusz ültetés lehetőség elöl: +20 mm, hátul: +30 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11550002</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>\n\n<p> </p>', 'AP made by KW Honda Civic, CRX, Coupé (Typ: EG2-6, 8, 9, EH6, 9, EJ12), 1992.04-1995.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-crx-coupe-typ-eg2-6-8-9-eh6-9-ej12-1992-04-1995-09-ig-allithato-magassagu-futomu'),
(715, '', '<p>Ez az állítható magasságú futómű kompatibilis a következő autótípusokkal: Honda Civic, CRX Coupé. A tipuskódok: EK1,3,4,EJ6,8,9 és az évjárat 1995.10-től. Az elöl tengelyterhelés 860 kg, míg a hátsó tengelyterhelés 790 kg. Fontos, hogy csak olyan modellekbe illik, amelyeknek a hátsó lengéscsillapítói villás kialakításúak.</p>  <ul> 	<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik.</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-75 mm, hátul: 40-75 mm között állítható (a futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokat fogadja el).</li> 	<li>Lehetséges plusz ültetés elöl: +20 mm, hátul: +30 mm.</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke Németországban.</li> 	<li>Garancia: 2 év.</li> </ul>  <p><strong>Cikkszám: GF50-003</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p>  <p> </p>', 'AP made by KW Honda Civic, CRX, Coupé (Typ: EK1, 3, 4, EJ6, 8, 9), 1995.10-2001.02-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-crx-coupe-typ-ek1-3-4-ej6-8-9-1995-10-2001-02-ig-allithato-magassagu-futomu'),
(716, '', '<strong>Vogtland</strong> által állítható magasságú futómű készlet HONDA CIVIC modellekhez</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1992-1995</li>\n	<li><strong>Ültetés mértéke</strong>: 40 - 75 / 40 - 75 mm</li>\n	<li><strong>Típus</strong>: Honda Civic, CRX, Coupé, Typ EG2-6, 8, 9, EH6, 9, EJ1, 2</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 840 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 750 kg</li>\n	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW500GF02_1498-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW500GF02_1498-10.pdf</a></li>\n</ul>\n<p>Az autó megjelenésén javítva maximális vezetési élményt nyújt. Az ültetés mértékét saját elképzelése alapján állíthatja be. A készlet kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a minőséget.</p>\n<p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A készlet általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968337</p>', 'Vogtland Honda Civic, CRX, Coupé, 1992.04-1995-ig állítható magasságú futómű', '', '', '', 'vogtland-honda-civic-crx-coupe-1992-04-1995-ig-allithato-magassagu-futomu'),
(717, '', '<p>A Vogtland állítható magasságú futómű készlet tökéletes választás a HONDA CIVIC számára. Ez a minőségi futómű szett biztosítja az autó megjelenésének javítását és maximális vezetési élményt nyújt. Az ültetés mértéke szabadon állítható az elképzeléseinek megfelelően. A készlet tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó kiváló teljesítményéhez.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel és a gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén. Az ültetőrugókra és lengéscsillapítókra 2 év garanciát vállalnak. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968512</p>', 'Vogtland Honda Civic, CRX, Coupé (Typ: EK1, 3, 4, EJ6, 8, 9), 1995.10-től állítható magasságú futómű', '', '', '', 'vogtland-honda-civic-crx-coupe-typ-ek1-3-4-ej6-8-9-1995-10-tol-allithato-magassagu-futomu'),
(718, '', '<p>A Honda Civic MTS-Technik Street Series sport futóműve állítható magasságú és tökéletes választás azok számára, akik fontosnak tartják a jó minőséget és kedvező árat. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága, fokozatmentesen. Az MTS-Technik futóművei optimalizált rugókkal és lengéscsillapítókkal rendelkeznek.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében.</li>\n	<li>Tökéletes összhang a rugók és lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Honda Civic, 2001-2006-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-honda-civic-2001-2006-ig-street-series-allithato-magassagu-futomu'),
(719, '', '<p>Ez a JOM Blueline Állítható magasságú futómű olyan autótípushoz használható, mint például a Honda Civic.</p>  <ul> 	<li>Tipuskód: FK1,FK2,FK3,FN1,FN3,FN4</li> 	<li>Évjárat: 2006.02 - 2012.01</li> 	<li>Tengelyterhelés elöl (kg): 940</li> 	<li>Tengelyterhelés hátul (kg): 835</li> 	<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-50 mm, hátul: 20-50 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> </ul> ', 'Jom Bochum Honda Civic (Typ: FK1, FK2, FK3, FN1,FN3, FN4), 2006.02-2012.01-ig, (első tengely terhelés 940kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-honda-civic-typ-fk1-fk2-fk3-fn1fn3-fn4-2006-02-2012-01-ig-els-tengely-terheles-940kg-alatt-allithato-magassagu-futomu'),
(720, '', '<p>Ez a JOM Blueline Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n<ul>\n	<li>Honda Civic</li>\n	<li>Tipuskód: FK1,FK2,FK3,FN1,FN3,FN4</li>\n	<li>Évjárat: 2006.02 - 2012.01</li>\n	<li>Tengelyterhelés elöl (kg): 941 - 1085</li>\n	<li>Tengelyterhelés hátul (kg): 835</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-50 mm, hátul: 20-50 mm között állítható<br />(A futómű minden esetben ennél nagyobb intervallumban állítható, azonban a TÜV engedély kizárólag a fent említett beállításokhoz kapcsolódik.)</li>\n</ul>', 'Jom Bochum Honda Civic (Typ: FK1, FK2, FK3, FN1, FN3, FN4), 2006.02-2012.01-ig, (első tengely terhelés 941-1090kg) állítható magasságú futómű', '', '', '', 'jom-bochum-honda-civic-typ-fk1-fk2-fk3-fn1-fn3-fn4-2006-02-2012-01-ig-els-tengely-terheles-941-1090kg-allithato-magassagu-futomu'),
(721, '', 'Az AP-Fahrwerke állítható magasságú futóművet tervezték a Honda Civic autótípushoz. Ez a futómű megfelel a következő típuskódoknak: FK1, FK2, FK3, FN1, FN3, FN4, és az évjáratoknak: 2006.02 - 2012.01. Az elülső tengelyterhelés 941-1090 kg, míg a hátsó tengelyterhelés 835 kg. A futómű német nyelvű TÜV engedéllyel rendelkezik, melyben meghatározzák az elülső és hátsó ültetés mértékét 20-50 mm között. Emellett lehetséges további +40 mm-el előre ültetni. A futóművet Németországban, az Ap-Fahrwerke gyárában gyártották. A termékre 2 év garancia vonatkozik, és a cikkszáma: 11550021. Az ár egy szettre vonatkozik.', 'AP made by KW Honda Civic (Typ: FK1, FK2, FK3, FN1, FN3, FN4), 2006.02-2012.01-ig, (első tengely terhelés 941-1090kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-typ-fk1-fk2-fk3-fn1-fn3-fn4-2006-02-2012-01-ig-els-tengely-terheles-941-1090kg-allithato-magassagu-futomu'),
(722, '', 'Ez a változtatható magasságú AP-Fahrwerke futómű megfelelő a következő Honda Civic modellekhez:<br />A futóművel ellátott TÜV engedéllyel rendelkezik, mely lehetővé teszi egy 20-50 mm-es ültetési intervallumot mind elöl, mind hátul. Ezen kívül van lehetőség +40 mm-es emelésre az elülső részen.<br />A futómű Németországban kerül gyártásra, és 2 év garanciát kínálnak rá.<br /><strong>Termékkód:</strong> 11550017<br />Az ár egy szettre vonatkozik!', 'AP made by KW Honda Civic (Typ: FK1, FK2, FK3, FN1,FN3, FN4), 2006.02-2012.01-ig, (első tengely terhelés 940kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-typ-fk1-fk2-fk3-fn1fn3-fn4-2006-02-2012-01-ig-els-tengely-terheles-940kg-alatt-allithato-magassagu-futomu'),
(723, '', '<div>\n    <p>Ez a módosítható magasságú futómű tökéletes választás a következő autótípushoz:</p>\n    <ul>\n        <li>Autó: Honda Civic Type R</li>\n        <li>Tipuskód: FN2</li>\n        <li>Típus variáció: Type R</li>\n        <li>Évjárat: 2007.03-tól</li>\n        <li>Tengelyterhelés elöl (kg): 980</li>\n        <li>Tengelyterhelés hátul (kg): 740</li>\n        <li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n        <li>Az engedély szerint az ültetés mértéke elöl: 0-30 mm, hátul: 0-30 mm között állítható<br />(A futómű egyéb beállításai is lehetségesek, de a TÜV engedély csak a fenti értékekre vonatkozik.)</li>\n        <li>Extra ültetési lehetőség elöl: +40 mm, hátul: +5 mm</li>\n        <li>Gyártó: Ap-Fahrwerke, Németország</li>\n        <li>Garancia: 2 év</li>\n    </ul>\n    <p><strong>Cikkszám: </strong>11550021<br />Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Honda Civic (Typ: FN2), 2.0 Type-R, 2007.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-typ-fn2-2-0-type-r-2007-03-tol-allithato-magassagu-futomu'),
(724, '', '<p><strong>Vogtland</strong> állítható magasságú futómű szett a <strong>HONDA CIVIC</strong> számára</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2006-2012</li>\n	<li><strong>Ültetés mértéke</strong>: 20 - 50 / 20 - 50 mm</li>\n	<li><strong>Típus</strong>: Honda Civic, Typ FK1, FK2, FK3, FN1, FN3, FN4</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1085 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 835 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyedi igényeknek megfelelően állíthatja. Ennek a kiváló minőségű futómű szetnek a részei speciális, nagy teljesítményű kétcsöves lengéscsillapítók, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortérzetet és fokozott dinamikát biztosítanak. Az első osztályú lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik <strong>TÜV minősítéssel</strong>. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 darab ültető rugóból és 4 darab lengéscsillapítóból áll, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p><strong>Made in Germany!</strong></p>\n<p>Cikkszám: 968725</p>', 'Vogtland Honda Civic (Typ: FK1, FK2, FK3, FN1, FN3, FN4), 2006.02-2012.01-ig, (első tengely terhelés 941-1085kg) állítható magasságú futómű', '', '', '', 'vogtland-honda-civic-typ-fk1-fk2-fk3-fn1-fn3-fn4-2006-02-2012-01-ig-els-tengely-terheles-941-1085kg-allithato-magassagu-futomu'),
(725, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: HONDA CIVIC</p>  \n<ul> 	\n  	<li><strong>Évjárat</strong>: 2006-2012</li> 	\n  	<li><strong>Ültetés mértéke</strong>: 20 - 50 / 20 - 50 mm</li> 	\n  	<li><strong>Típus</strong>: Honda Civic, Typ FK1, FK2, FK3, FN1, FN3, FN4</li> 	\n  	<li><strong>Max. tengelyterhelés elõl</strong>: 940 kg</li> 	\n  	<li><strong>Max. tengelyterhelés hátul</strong>: 835 kg</li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett teljes körű vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét saját igényei szerint állíthatja be. A kiváló minőségű futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően garantálják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  \n<p>A szett alapvetően tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel rendelkeznek.</p>  \n<p>Made in Germany!</p>  \n<p>Cikkszám: 968723</p>  ', 'Vogtland Honda Civic (Typ: FK1, FK2, FK3, FN1, FN3, FN4), 2006.02-2012.01-ig, (első tengely terhelés 940kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-honda-civic-typ-fk1-fk2-fk3-fn1-fn3-fn4-2006-02-2012-01-ig-els-tengely-terheles-940kg-alatt-allithato-magassagu-futomu'),
(726, '', '<strong>Vogtland</strong> állítható magasságú futómû szett a HONDA CIVIC modellekhez</p>  <ul> 	<li><strong>Évjárat</strong>: 2007-tõl</li> 	<li><strong>Ültetés mértéke</strong>: 0 - 30 / 0 - 30 mm</li> 	<li><strong>Típus</strong>: Honda Civic, Typ FN2, Type-R</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 980 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 740 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett ez a futómű szett optimális vezetési élményt nyújt. Az ültetés mértékét a felhasználó saját igényeinek megfelelően állíthatja be. Ennek a kiváló minőségű futómű szettnek a speciális, nagy teljesítményű kétcsöves lengéscsillapítók a kulcsai, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortérzetet és a fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968724</p>', 'Vogtland Honda Civic (Typ: FN2), 2.0 Type-R, 2007.03-tól állítható magasságú futómű', '', '', '', 'vogtland-honda-civic-typ-fn2-2-0-type-r-2007-03-tol-allithato-magassagu-futomu'),
(727, '', '<p><strong>Honda Civic nyolcadik generációjú Bilstein B14 állítható magasságú futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Honda Civic Hatchback</strong> modellek 1.4 és 1.8 motorral</li>\\r\\n	<li><strong>Honda Civic Sedan</strong> modellek 1.3 IMA hibrid motorral</li>\\r\\n</ul>\\r\\n\\r\\n<p>A BILSTEIN által kifejlesztett egycsöves rendszer<br />\\r\\nSpeciális Upside-Down technológiával<br />\\r\\nKiváló minőségű versenysport rugók<br />\\r\\nAz állítható magasság lehetősége (az alumíniumból készült rugótányér és kontra anya révén)<br />\\r\\nA B14 futóművön a BILSTEIN mérnökei által megvalósított versenysport technológia az utcára is elhozható, mely hatalmas előnyt jelent. A B14 PSS futóműnél a jármű magassága az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy meghatározott 20 mm-es állítási tartományon belül. Az extrém terhelhetőségre tervezett B14 PSS egyedi egycsöves Upside-Down technológiája minden helyzetben gondoskodik a kiegyensúlyozott menetteljesítményről és a vezetés öröméről.</p>\\r\\n', 'Bilstein Honda Civic 8gen, 2005.09-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-honda-civic-8gen-2005-09-tol-bilstein-b14-allithato-magassagu-futomu'),
(728, '', 'Ez az állítható magasságú futómű megfelel a következő Honda Civic típusnak (FK) az alábbi motorváltozatokkal: 1.4i-VTEC, 1.6i-TDTEC, 1.8i-VTEC, 2.0 Type-R, 2.2i-DTEC és az években 2006.02 - 2012.01 között. A futóműszett rendelkezik Német nyelvű TÜV engedéllyel. Az ültetés mértéke elöl 20-50 mm, hátul 20-50 mm között állítható. Az engedélyben meghatározott intervallumon belül állítható, de a TÜV engedély csak ezekkel az értékekkel érvényes. Van lehetőség további +40 mm-el elöl ültetni. A termék Németországban készült, és 2 év garanciát biztosítanak rá. A cikkszám: 11550030. Az ár 1 szettre vonatkozik!', 'AP made by KW Honda Civic (Typ: FK), 1.4i-VTEC, 1.6i-TDTEC, 1.8i-VTEC, 2.0 Type-R, 2.2i-DTEC, 2012.02-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-civic-typ-fk-1-4i-vtec-1-6i-tdtec-1-8i-vtec-2-0-type-r-2-2i-dtec-2012-02-tol-allithato-magassagu-futomu'),
(729, '', '<p>Ez a szabályozható magasságú futómű a Honda Integra DC2 típusú autókhoz illeszkedik.</p> <ul> 	<li>Típus variáció:</li> 	<li>Évjárat: 1997.11-től</li> 	<li>Tengelyterhelés elöl (kg): 835</li> 	<li>Tengelyterhelés hátul (kg): 680</li> 	<li>Egyéb kitételek: Csak olyan modellekhez, amelyek hátsó lengéscsillapítói szemes kialakításúak.</li> </ul>  <ul> 	<li>Ez a futóműrendszer német nyelvű TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-70 mm, hátul: 30-50 mm között szabályozható<br /> 	(Minden esetben a megadottnál nagyobb intervallumban állítható, azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li> 	<li>Extrém ültetési lehetőség elöl: +20 mm, hátul: +35 mm</li> </ul>  <ul> 	<li>Gyártva: Ap-Fahrwerke Németországban</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF50-004</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p>  ', 'AP made by KW Honda Integra (Typ: DC2), 1997.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-honda-integra-typ-dc2-1997-11-tol-allithato-magassagu-futomu'),
(730, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: HONDA INTEGRA</p>\n<ul>\n<li><strong>Évjárat</strong>: 1997-től</li>\n<li><strong>Ültetés mértéke</strong>: 30 - 70 / 30 - 50 mm</li>\n<li><strong>Típus</strong>: Honda Integra, Typ DC2</li>\n<li><strong>Max. tengelyterhelés elöl</strong>: 835 kg</li>\n<li><strong>Max. tengelyterhelés hátul</strong>: 680 kg</li>\n<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW500GF04_1500-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW500GF04_1500-10.pdf</a></li>\n</ul>\n<p>Az autó megjelenésének javítása mellett ez a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968338</p>', 'Vogtland Honda Integra (Typ: DC2), 1997.11-től állítható magasságú futómű', '', '', '', 'vogtland-honda-integra-typ-dc2-1997-11-tol-allithato-magassagu-futomu'),
(731, '', '<p>A Bilstein B14 egy állítható magasságú sport futómű, mely kifejezetten a Honda S2000 autókhoz lett tervezve. Ez a tuning futómű lehetővé teszi a sportosabb vezetési élményt, és a magasság szabályozhatósága segítségével testreszabható a felhasználó igényeinek megfelelően. A Bilstein B14 Honda S2000 sport futómű egy kiváló választás azoknak, akik szeretnék javítani autójuk teljesítményét és vezetési élményét.</p>', 'Bilstein Honda S2000, 1999.03-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-honda-s2000-1999-03-tol-bilstein-b14-allithato-magassagu-futomu'),
(732, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság könnyedén szabályozható a útviszonyoknak megfelelően, így az autó hasmagassága könnyedén beállítható. Az MTS-Technik futóművei optimális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Ez a futómű nem rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Mitsubishi Galant 6 (Typ: EA) Kombi, 1999.09-2003.10-ig,  állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-mitsubishi-galant-6-typ-ea-kombi-1999-09-2003-10-ig--allithato-magassagu-futomu'),
(733, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz, és optimalizálható az autó hasmagassága. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók között tökéletes egyensúly van, biztosítva ezzel a kiváló teljesítményt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>Ez a futómű nem rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Mitsubishi Galant 6 (Typ: EA) Sedan, 1996.09-2004.10-ig,  állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-mitsubishi-galant-6-typ-ea-sedan-1996-09-2004-10-ig--allithato-magassagu-futomu'),
(734, '', '<strong>Mitsubishi Lancer EVO 10 D2 Racing Sport állítható magasságú és állítható keménységű futómű szettek</strong></p>\\r\\n\\r\\n<p>A csillapítás keménysége 36 fokozatban állítható</p>\\r\\n\\r\\n<p>A magasság szabadon állítható, egészen -120mm-ig</p>\\r\\n\\r\\n<p>A rugóút szabályozható</p>\\r\\n\\r\\n<p>A rugóállandó egyénileg választható (3,5; 5; 7; 9; 11; 13; 15; 18; 22 kg/mm)</p>\\r\\n\\r\\n<p>A szár teflonborítással rendelkezik</p>\\r\\n\\r\\n<p>A szerkezet 6061-es alumíniumból készült</p>\\r\\n\\r\\n<p>A kerék dőlésszöge állítható</p>\\r\\n\\r\\n<p><strong>Normál és fordított lengéscsillapító szettek rendelhetők, attól függően, hogy milyen célra használják: utcai, pályaversenyzés, drift, rally (aszfalt, murva)</strong></p>\\r\\n\\r\\n<p>Minden lengéscsillapító szett gumibetétes toronycsapággal van felszerelve, egyes típusokhoz opcióként rendelhető a 2D toronycsapágy (állítható kerék dőlésszög)</p>\\r\\n\\r\\n<p>A 3D toronycsapágy (állítható kerék dőlésszög és utánfutás) felár ellenében rendelhető!</p>\\r\\n', 'D2 Racing Mitsubishi Lancer EVO 10, 2008.03-tól, állítható keménységű állítható magasságú futómű', '', '', '', 'd2-racing-mitsubishi-lancer-evo-10-2008-03-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(735, '', '<p>Egyedi D2 Racing Sport futóművek, melyeket széles körben lehet beállítani az autó teljesítményének maximalizálása érdekében. A csillapítás keménysége 36 fokozatban állítható, a magasság pedig akár -120mm-ig szabadon szabályozható. Emellett rugóút is állítható, és különböző rugóállandók közül lehet választani. A futóművek Teflonborítású szárral és 6061-es alumínium szerkezettel rendelkeznek. Az állítható kerék dőlésszög lehetővé teszi a finomhangolást az optimális teljesítmény eléréséhez.</p>\n<p>A lengéscsillapító szettek normál és fordított rendszerben is rendelhetők, és alkalmasak utcai, pályaversenyzés, drift és rally (aszfalt, murva) használatra. Mindegyik lengéscsillapító szett gumibetétes toronycsapággal van ellátva, és opcionálisan kérhető hozzá 2D toronycsapágy (állítható kerék dőlésszög). A 3D toronycsapággyal rendelkező verzióban a kerék dőlésszögen kívül az utánfutás is állítható, ezért extra költséggel rendelhető.</p>', 'D2 Racing Mitsubishi Lancer Evo 7-8-9, 2001-től, állítható keméységű állítható magasságú futómű', '', '', '', 'd2-racing-mitsubishi-lancer-evo-7-8-9-2001-tol-allithato-kemeyseg-allithato-magassagu-futomu'),
(736, '', '<div><strong>Mitsubishi Lancer EVO 7, 8, 9 Bilstein B14 állítható magasságú sport futómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az elülső és hátsó ültetés mértéke 40-50 mm között változtatható.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely terhelése 1015 kg, míg a hátsó tengely terhelése 900 kg.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel, ami garanciát nyújt a minőségre.</div>\\r\\n', 'Bilstein Mitsubishi Lancer EVO 7-8-9, 2000.03-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-mitsubishi-lancer-evo-7-8-9-2000-03-tol-bilstein-b14-allithato-magassagu-futomu'),
(737, '', '<strong>Mitsubishi Lancer EVO 7-8-9 BILSTEIN B16 PSS9 állítható magasságú és keménységű futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>BILSTEIN egycsöves rendszerrel rendelkezik</li>\\r\\n	<li>BILSTEIN gáztöltéses technológiával működik</li>\\r\\n	<li>Egyszerűen beállítható csillapítási erővel rendelkezik</li>\\r\\n	<li>Triple-C-Technology felületkezeléssel készült a hosszú távú korrózióvédelem érdekében</li>\\r\\n	<li>Alulról felfelé működő technológiával van ellátva</li>\\r\\n	<li>Nagy szilárdságú anyagból készült versenysportrugókkal</li>\\r\\n	<li>Alumíniumból készült rugótányér és kontra anya segítségével állítható magasság</li>\\r\\n	<li>9 fokozatban beállítható húzó és nyomófokozat</li>\\r\\n	<li>TÜV minősítéssel rendelkezik</li>\\r\\n</ul>\\r\\n\\r\\n<p>A BILSTEIN mérnökei által tervezett futómű egy új teljesítménykategóriát képvisel! A B16 PSS9 lengéscsillapítóval a jármű magassága az első és hátsó tengelyen akár 50 mm-rel is csökkenthető egy beállítási tartományon belül, mely 20 mm-es. Az előre beépített állapotban 9 különböző karakterisztika közül választhat, biztosítva a jármű professzionális beállítását minden helyzetben.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Elöl: 40-50 mm-es állítási tartomány</li>\\r\\n	<li>Hátul: 40-50 mm-es állítási tartomány</li>\\r\\n	<li>TÜV engedéllyel rendelkezik</li>\\r\\n</ul>\\r\\n', 'Bilstein Mitsubishi Lancer EVO 7-8-9, 2000.03-tól, Bilstein B16, állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-mitsubishi-lancer-evo-7-8-9-2000-03-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(738, '', '<strong>Állítható magasságú futómű az Opel Adamhoz a V-Maxx-tól</strong><br /><br /><ul><li>Az Adam modellekhez készült futómű alkalmas a 1.0 / 1.2 / 1.4 / 1.4 LPG / 1.4 Turbo változatokhoz</li><li>A futómű elülső ültetése 35-70mm között állítható</li><li>A hátsó ültetés mértéke 30-60mm között állítható</li><li>Az általunk kínált termék rendelkezik TÜV engedéllyel</li></ul>', 'V-Maxx Opel Adam, 1.0, 1.2, 1.4, 1.4 LPG, 1.4 Turbo, 2012.10-től állítható magasságú futómű', '', '', '', 'v-maxx-opel-adam-1-0-1-2-1-4-1-4-lpg-1-4-turbo-2012-10-tol-allithato-magassagu-futomu'),
(739, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A magasság fokozatmentesen állítható, így könnyedén lehet igazítani az autó hasmagasságát az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát kínálják.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Opel Adam, 2012.10-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-adam-2012-10-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(740, '', '<p>Egyedi és kiváló minőségű MTS-Technik állítható magasságú sport futóművek, melyek ideális választások azoknak, akik számára fontos a prémium minőségű termék megfizethető áron. Az állítható magasság fokozatmentesen szabályozható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz.</p>\n\n<p><u>Alkalmas az alábbi típusokhoz:</u></p>\n\n<ul>\n	<li><strong>Opel Astra F Sedan:</strong> 1.4 i / 1.6 i / 1.6 i 16V</li>\n	<li><strong>Opel Astra F Liftback (csapott hátú):</strong> számos változat</li>\n	<li><strong>Opel Astra F Cabrio:</strong> 1.4 Si / 1.4 i 16V / 1.6 i / 1.8 i 16V / 2.0 i</li>\n	<li><strong>Fontos:</strong> Caravan típusokhoz nem használható!</li>\n	<li>Ültetés mértéke elöl: 40-90mm</li>\n	<li>Ültetés mértéke hátul: 70-100mm</li>\n	<li>Első tengely terhelés: 870kg</li>\n	<li>Hátsó tengely terhelés: 800kg</li>\n	<li>TÜV engedélyeztetése folyamatban!</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>Rugók: <strong>Eibach</strong> gyártmányúak</li>\n	<li>Állítható magasság: általában 25 és 80 mm között</li>\n	<li>Lengéscsillapítók: gáztöltésűek</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelemért</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangja</li>\n	<li>Plug & play készlet, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n\n<p><u><strong>Termék jellemzők:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n\n<p><em>A weboldalon található szöveges és képi tartalmak másolása és sokszorosítása engedély nélkül tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Astra F, kivéve Caravan, 1991.09-1998.01-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-astra-f-kiveve-caravan-1991-09-1998-01-ig-street-series-allithato-magassagu-futomu'),
(741, '', '<div><strong>Opel Astra G Jom BlueLine állítható magasságú sportfutómű</strong></div>\\r\\n\\r\\n<div>\\r\\n<ul>\\r\\n	<li>Típus: G</li>\\r\\n	<li>Kivéve az OPC változat</li>\\r\\n	<li>Évjárat: 1998 március - 2005 október</li>\\r\\n	<li><strong>A futómű telepítéséhez ajánlott rövidített stabilizátor szett használata! A szett nem szerepel a csomagban. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n	<li>Tengelyterhelés elöl: 1040 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 960 kg</li>\\r\\n</ul>\\r\\n<span>A BlueLine állítható magasságú futóművek kiemelkedő minőséget képviselnek, mindegyik futómű típus specifikus. Az autó magassága egy adott tartományon belül változtatható a speciális állítókulcs segítségével.</span><br />\\r\\n<br />\\r\\n<span>- 19.3 TÜV minősítéssel rendelkezik</span><br />\\r\\n<span>- EPS technológiával porfestett és horganyzott alkatrészekkel</span></div>\\r\\n', 'Jom Bochum Opel Astra G, 1998.03-2005.10-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-astra-g-1998-03-2005-10-ig-blue-line-allithato-magassagu-futomu'),
(742, '', '<div><strong>FK-Automotive által gyártott állítható magasságú sport futómű Opel Astra G modellekhez</strong></div>\\r\\n\\r\\n<div>A futómű megfelelő a G típuskódú Opel Astra modellekhez, az évjáratot tekintve 1998. márciustól egészen 2005. októberéig használható.</div>\\r\\n\\r\\n<div>Felhívjuk a figyelmét, hogy ennek a futóműnek a telepítéséhez elengedhetetlen a rövidített stabilizátor rúd, melyet a szett tartalmazza.</div>\\r\\n\\r\\n<div>A futómű terhelése elöl 1040 kg, míg hátul 845 kg.</div>\\r\\n\\r\\n<div>A termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, mely a csomagolásban megtalálható.</div>\\r\\n\\r\\n<div>A futóműre 1 ÉV TELJESKÖRŰ GARANCIA vonatkozik, mely kiváló minőségű terméket biztosít hihetetlenül jó áron.</div>\\r\\n\\r\\n<div>A szett tartalmazza: 4db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1db kulcsot az állításhoz.</div>', 'FK-Automotive Opel Astra G, 1998.03-2005.10-ig állítható magasságú futómű', '', '', '', 'fk-automotive-opel-astra-g-1998-03-2005-10-ig-allithato-magassagu-futomu'),
(743, '', '<p><strong>MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Opel Astra G Hatchback, </strong>1.2 / 1.2 16V / 1.4 / 1.4 16V / 1.6 / 1.6 16V / 1.8 16V / 2.0 16V / 2.0 OPC / 2.2 16V / 1.7 CDTI / 1.7DTI / 1.7TD / 2.0 DTI</li>\\r\\n	<li><strong>Opel Astra G Coupé, </strong>1.2 / 1.2 16V / 1.4 / 1.4 16V / 1.6 / 1.6 16V / 1.8 16V / 2.0 16V / 2.0 OPC / 2.2 16V / 1.7 CDTI / 1.7DTI / 1.7TD / 2.0 DTI</li>\\r\\n	<li><strong>A futómű beépítéséhez rövidített stabilizátorrúd ajánlott!</strong></li>\\r\\n	<li><strong>Letölthető dokumentumok: <a href=\\\"https://mtstechnik.com/data/links/82e78219b6d5de8a4c509f8409354efa/27018_7206.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/a58dce39ec4ad6a28ca614da496d629a/27018_7205.pdf\\\"><span>szerelési útmutató</span></a></strong></li>\\r\\n	<li><span>Első tengely terhelés: 1040kg</span></li>\\r\\n	<li><span>Hátsó tengely terhelés: 895kg</span></li>\\r\\n</ul>\\r\\n\\r\\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és a versenyképes ár. A magasság folyamatosan szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik sport futóművei kiemelkedő egyensúlyt biztosítanak a rugók és lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>kiváló hatékonyság extrém igénybevétel esetén is</li>\\r\\n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>ideális egyensúly a rugók és lengéscsillapítók között</li>\\r\\n	<li>a készlet könnyen telepíthető, nem szükséges módosítás az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Opel Astra G, kivéve Caravan és Cabrio, 1998-2004-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-astra-g-kiveve-caravan-es-cabrio-1998-2004-ig-street-series-allithato-magassagu-futomu'),
(744, '', '<p><strong>MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Opel Astra G Hatchback, </strong>1.2 / 1.2 16V / 1.4 / 1.4 16V / 1.6 / 1.6 16V / 1.8 16V / 2.0 16V / 2.0 OPC / 2.2 16V / 1.7 CDTI / 1.7DTI / 1.7TD / 2.0 DTI</li>\\r\\n	<li><strong>Opel Astra G Coupé, </strong>1.2 / 1.2 16V / 1.4 / 1.4 16V / 1.6 / 1.6 16V / 1.8 16V / 2.0 16V / 2.0 OPC / 2.2 16V / 1.7 CDTI / 1.7DTI / 1.7TD / 2.0 DTI</li>\\r\\n	<li><strong>A futómű beépítéséhez rövidített stabilizátorrúd ajánlott!</strong></li>\\r\\n	<li><strong>Letölthető dokumemntumok: <a href=\\\"https://mtstechnik.com/data/links/82e78219b6d5de8a4c509f8409354efa/27018_7206.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/a58dce39ec4ad6a28ca614da496d629a/27018_7205.pdf\\\"><span>szerelési útmutató</span></a></strong></li>\\r\\n	<li><span>Első tengely terhelés: 1040kg</span></li>\\r\\n	<li><span>Hátsó tengely terhelés: 895kg</span></li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>MTS-Technik Comfort állítható magasságú sport futómű, gewinde</strong></p>\\r\\n\\r\\n<p>Az <strong>MTS-Technik Comfort Series állítható magasságú sport futóművei</strong> ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! Fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően! Az <strong>MTS-Technik Comfort állítható futóművei</strong> optimális egyensúlyt teremtenek az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>speciális <strong>Eibach rugók a maximális kényelem érdekében</li>\\r\\n	<li>a <strong>Comfort Series</strong> létrehozása során nem az extrém ültetés, hanem a <strong>magas kényelem</strong> volt a fókuszban</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></p>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Opel Astra G, kivéve Caravan és Cabrio, 1998-2004-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-astra-g-kiveve-caravan-es-cabrio-1998-2004-ig-comfort-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(745, '', 'Ez az állítható magasságú futómű megfelel a következő autótípusokhoz:<br />Tipuskód: T98, / V / C, T98/NB<br />Típus variáció:<br />Évjárat: 1998.05-től<br />Tengelyterhelés elöl (kg): 1040<br />Tengelyterhelés hátul (kg): 900<br />Egyéb javaslatok: Az eredeti gumik és felnik kombinációjához ajánlott szélesítők használata!<br /><br />Ez a futóműszett rendelkezik TÜV engedéllyel Németországból.<br />Az engedély által meghatározott ültetési lehetőségek: elöl 30-65 mm között, hátul 20-50 mm között állítható.<br />Extra ültetési lehetőségek: elöl +20 mm, hátul +0 mm<br /><br />Gyártó: Ap-Fahrwerke, Németország<br />Garancia időtartama: 2 év<br /><br /><strong>Cikkszám: GF60-039</strong><br /><br />Az ár egy szettre vonatkozik!', 'AP made by KW Opel Astra G, 3-5 ajtós, Sedan, Coupé, 1998.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-g-3-5-ajtos-sedan-coupe-1998-03-tol-allithato-magassagu-futomu'),
(746, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Opel Astra G Cabrio</li>\\r\\n	<li>Tipuskód: T98C</li>\\r\\n	<li>Típus variáció:</li>\\r\\n	<li>Évjárat: 1998.05-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1040</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1000</li>\\r\\n	<li>Egyéb kitételek: Az eredeti méretű gumiabroncsok és felnik használata esetén sárvédő szélesítő felszerelése szükséges!</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-60 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, azonban a TÜV engedély kizárólag a fent említett beállításokra vonatkozik.)</li>\\r\\n	<li>Extra ültetési lehetőség elöl: +20 mm, hátul: +10 mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\\r\\n	<li>Garancia: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: GF60-040</strong></p>\\r\\n\\r\\n<p><br />\\r\\nAz ár egy szettre vonatkozik!</p>\\r\\n', 'AP made by KW Opel Astra G Caravan, 1998.05-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-g-caravan-1998-05-tol-allithato-magassagu-futomu'),
(747, '', '<div>\n  <p>Ez az állítható magasságú AP-Fahrwerke futómű megfelel az alábbi autótípusnak:</p>\n  <ul>\n    <li>Opel Astra G Cabrio</li>\n    <li>Tipuskód: T98C</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 1998.05-től</li>\n    <li>Tengelyterhelés elöl (kg): 1040</li>\n    <li>Tengelyterhelés hátul (kg): 1000</li>\n    <li>Egyéb kitételek: A gyári méretű gumi és felnikombináció esetén nyomtávszélesítő felszerelése szükséges!</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-60 mm között állítható<br />\n        (A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokat engedélyezi.)</li>\n    <li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +10 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártva: Ap-Fahrwerke Németországban</li>\n    <li>Garancia időtartama: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF60-040</strong></p>\n  <p><br />\n  Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Opel Astra G Cabrio, 2000.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-g-cabrio-2000-04-tol-allithato-magassagu-futomu'),
(748, '', '<h2>Vogtland állítható magasságú futómű szett: OPEL ASTRA</h2>\n<ul>\n	<li><strong>Évjárat</strong>: 2000-2005</li>\n	<li><strong>Ültetés mértéke</strong>: 30 - 65 / 20 - 50 mm</li>\n	<li><strong>Típus</strong>: Opel Astra G, Typ T98C, Cabrio</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1040 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1000 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett teljes körű vezetési élményt nyújt ez a kiváló minőségű futómű szett. Az ültetés mértékét az egyéni preferenciák szerint állíthatja be a megfelelő értékek között. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968514</p>', 'Vogtland Opel Astra G Cabrio, 2000.04-től állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-g-cabrio-2000-04-tol-allithato-magassagu-futomu'),
(749, '', '<strong>Vogtland</strong> állítható magasságú futómű szett az OPEL ASTRA számára.</p>  <ul> 	<li><strong>Évjárat</strong>: 1998-2005</li> 	<li><strong>Ültetés mértéke:</strong> 30 - 65 / 20 - 50 mm</li> 	<li><strong>Típus</strong>: Opel Astra G, Typ T98, / V / C, T98/NB, Lim. / Sedan, Coupé</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1040 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 900 kg</li> </ul>  <p>A futómű javítja az autó megjelenését és növeli a vezetési élményt. A beállítások lehetővé teszik az ültetés mértékének személyre szabását. A futómű tartalmaz nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú lengéscsillapítók korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, és 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>  <p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel rendelkeznek.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968513</p> ', 'Vogtland Opel Astra G Sedan és Coupé, 1998.03-tól állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-g-sedan-es-coupe-1998-03-tol-allithato-magassagu-futomu'),
(750, '', '<p>A Vogtland állítható magasságú futómű szett célja az Opel Astra G típusú autók megjelenésének javítása és a vezetési élmény maximalizálása. Az ültetés mértéke szabadon állítható a 30-65 / 20-50 mm tartományban, lehetővé téve az egyéni preferenciák szerinti beállítást. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók első osztályú korrózióvédelemmel rendelkeznek.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968206</p>', 'Vogtland Opel Astra G Hatchback és Caravan, 1998.03-2004.12-ig állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-g-hatchback-es-caravan-1998-03-2004-12-ig-allithato-magassagu-futomu'),
(751, '', '<p>Egy állítható magasságú sport futómű, melyet az Opel Astra H és Twin Top modellekhez terveztek.</p>\\r\\n\\r\\n<p>Ez a futómű alkalmas az 2004-től 2010-ig gyártott Opel Astra H és Twin Top Typ H modellekhez (2007 - 2010).</p>\\r\\n\\r\\n<p>A futómű hátsó tengelyénél a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>A futómű beszereléséhez javasolt rövidített stabilizátor szett használata. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix).</p>\\r\\n\\r\\n<p>A tengelyterhelés elöl 1070 kg, míg hátul 955 kg.</p>\\r\\n\\r\\n<p>A futómű minőségi német termék, mely rendelkezik TÜV engedéllyel, amelyet a csomagolásban találsz.</p>\\r\\n\\r\\n<p>2 év teljes körű garanciával!</p>\\r\\n\\r\\n<p>A futómű szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot.</p>\\r\\n', 'Jom Bochum Opel Astra H, beleértve TwinTop és Caravan, 2004-2010-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-astra-h-beleertve-twintop-es-caravan-2004-2010-ig-blue-line-allithato-magassagu-futomu'),
(752, '', '<p>A FK-Automotive által gyártott állítható magasságú sport futómű Opel Astra H modellekhez készült. Az évjárat 2004-től 2010-ig terjed, kivéve a Cabrio és Caravan változatokat. Fontos megjegyezni, hogy a futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szetnek. Az elő tengely terhelése 1070 kg, míg a hátsó tengelyé 930 kg. A termék MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 1 ÉV TELJESKÖRŰ GARANCIÁVAL kapható!</p>', 'FK-Automotive Opel Astra H, kivéve Cabrio és Caravan, 2004-2010-ig állítható magasságú futómű', '', '', '', 'fk-automotive-opel-astra-h-kiveve-cabrio-es-caravan-2004-2010-ig-allithato-magassagu-futomu'),
(753, '', '<p>Az MTS-Technik által készített állítható magasságú sport futóművek kiváló választások azok számára, akik nagy hangsúlyt fektetnek a minőségre és az ár-érték arányra. Ezek a futóművek lehetővé teszik a magasság fokozatmentes állítását, így könnyedén alkalmazkodhatnak az útviszonyokhoz, és beállítható az autó hasmagassága. Az MTS-Technik futóművei kiváló összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek során is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Astra H, beleértve Sedan, Caravan, Cabrio, GTC, kivéve IDS futóművel szerelt, 2004.08-2010.10-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-astra-h-beleertve-sedan-caravan-cabrio-gtc-kiveve-ids-futomuvel-szerelt-2004-08-2010-10-ig-street-series-allithato-magassagu-futomu'),
(754, '', '<br />    <div><br />        <strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">A V-Maxx állítható magasságú sport futómű választható az Opel Astra H modellekhez</strong><br />    </div><br />', 'V-Maxx Opel Astra H, beleértve GTC, kivéve Caravan, TwinTop, 2005-2010.06-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-astra-h-beleertve-gtc-kiveve-caravan-twintop-2005-2010-06-ig-allithato-magassagu-futomu'),
(755, '', '<div>\\n<strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">A V-Maxx futómű kifejezetten az Opel Astra H modellhez lett tervezve, és lehetőséget biztosít az állítható magasságra.</strong>\\n', 'V-Maxx Opel Astra H Caravan, TwinTop, 2005-2011.07-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-astra-h-caravan-twintop-2005-2011-07-ig-allithato-magassagu-futomu'),
(756, '', '<p>Az MTS-Technik Street Series állítható magasságú sport futóművek ideális választást jelentenek azoknak, akik nem szeretnének kompromisszumot kötni autójuk teljesítményében. Ezek a futóművek fokozatmentesen szabályozható magassággal rendelkeznek, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművek tökéletes egyensúlyt teremtenek az Eibach által gyártott rugók és lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>a Sport Series létrehozása során a szélesebb ültetési tartomány és a fokozott vezetési élmény volt a cél</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Astra H, beleértve Sedan, Caravan, Cabrio, GTC, kivéve IDS futóművel szerelt, 2004.08-2010.10-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-astra-h-beleertve-sedan-caravan-cabrio-gtc-kiveve-ids-futomuvel-szerelt-2004-08-2010-10-ig-sport-series-allithato-magassagu-futomu'),
(757, '', '<div>\n  <p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómű</strong> alkalmas az alábbi autótípusra:</p>\n  <ul>\n    <li>Opel Astra H Limousine, Twin Top</li>\n    <li>Tipuskód: A-H</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 2004.04-től</li>\n    <li>Tengelyterhelés elöl (kg): 1070</li>\n    <li>Tengelyterhelés hátul (kg): 955</li>\n    <li>Egyéb kitételek: Az eredeti gumik és felnik esetén nyomtávszélesítőre van szükség!<br /> Elektromágneses futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> (Az intervallum ennél tágabb is lehet, de a TÜV engedély csak ezekkel az értékekkel érvényes.)</li>\n    <li>Extra ültetési lehetőség elöl: +20 mm, hátul: +0 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: Made In Ap-Fahrwerke Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF60-030</strong></p>\n  <p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Opel Astra H Sedan, beleértve Twin Top, 2004.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-h-sedan-beleertve-twin-top-2004-03-tol-allithato-magassagu-futomu'),
(758, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n<ul>\n	<li>Opel Astra H GTC Coupé, beleértve az OPC változatot</li>\n	<li>Tipuskód: A-H/C</li>\n	<li>Típusvariáció</li>\n	<li>Évjárat: 2005.03-tól</li>\n	<li>Tengelyterhelés elöl (kg): 1060</li>\n	<li>Tengelyterhelés hátul (kg): 840</li>\n	<li>Egyéb kitételek: Az eredeti méretű gumiabroncs és felnikombináció esetén szükséges a nyomtávszélesítő felszerelése!<br /> Elektromágneses futóművel (DCC) felszerelt járműveknél az elektronikus vezérlőegység inaktiválása szükséges!<br /> Az említett ültetés mértéke a tényleges érték. A gyári ültetés figyelembevételével az új ültetési mérték kerül megadásra!</li>\n</ul>\n<ul>\n	<li>Ez a futóműkészlet rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>A TÜV engedélyben meghatározott ültetési intervallum elöl: 25-50 mm, hátul: 15-40 mm között állítható<br /> (Nagyobb intervallumon belül is beállítható a futómű, de a TÜV engedély csak a fenti intervallumokra vonatkozik.)</li>\n	<li>Extra ültetési lehetőség elöl: +25 mm, hátul: +0 mm</li>\n</ul>\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF60-044</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Opel Astra H GTC Coupé, 2005.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-h-gtc-coupe-2005-03-tol-allithato-magassagu-futomu'),
(759, '', '<div>\n    <p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómû</strong> alkalmas az alábbi autótípusokhoz:</p>\n    <ul>\n        <li>Opel Astra H Limousine, Twin Top</li>\n        <li>Tipuskód: A-H</li>\n        <li>Típus variáció:</li>\n        <li>Évjárat: 2004.04-tõl</li>\n        <li>Tengelyterhelés elöl (kg): 1070</li>\n        <li>Tengelyterhelés hátul (kg): 955</li>\n        <li>Egyéb kitételek: Az eredeti méretû gumiabroncsok és felnik használata esetén nyomtávszélesítõ szükséges!<br /> Elektromágneses futómûvel (DCC) felszerelt jármûveknél az elektronikus vezérlõegység deaktiválása szükséges!</li>\n    </ul>\n    <ul>\n        <li>Ez a futómûszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n        <li>Az engedélyben meghatározott ültetési tartomány: elöl 30-65 mm, hátul 30-65 mm között állítható<br />(A futómű bármely pontjánál ennél nagyobb intervallumban állítható, de a TÜV engedély csak az említett beállításokra vonatkozik.)</li>\n        <li>Extra ültetési lehetőség: elöl +20 mm, hátul +0 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: Ap-Fahrwerke, Németország</li>\n        <li>Garancia: 2 év</li>\n    </ul>\n    <p><strong>Cikkszám: GF60-030</strong></p>\n    <p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Opel Astra H Caravan, 2004.08-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-h-caravan-2004-08-tol-allithato-magassagu-futomu'),
(760, '', '<p>A Vogtland állítható magasságú futómű szett megfelelővé teszi az autó megjelenését és garantálja a kiváló vezetési élményt. Ezzel a minőségi futómű szettel az ültetés mértékét személyre szabhatja a saját igényei szerint. A kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezővel vagy torziós futóművel vannak felszerelve.</p>\n<p>Termékjelölés: 968340</p>', 'Vogtland Opel Astra H GTC Coupé, 2005.03-tól állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-h-gtc-coupe-2005-03-tol-allithato-magassagu-futomu'),
(761, '', '<p>A Vogtland által készített állítható magasságú futómű szettet az Opel Astra személyautókhoz tervezték, az években 2004-2008. Az ültetés mértéke 30-60 mm-el a gyári beállításhoz képest. Ez a futómű szett kompatibilis az Opel Astra H, Typ A-H/SW és Caravan típusokkal. Az elülső maximális tengelyterhelés 1070 kg, míg a hátsóé 1000 kg.</p>\n\n<p>Ez a kiváló minőségű futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. Az ültetés mértékét a felhasználó saját igényei szerint állíthatja. A készlet tartalmazza a speciális, nagy teljesítményű, kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózió elleni védelemmel rendelkeznek.</p>\n\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968339</p>', 'Vogtland Opel Astra H Caravan, 2004.08-tól állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-h-caravan-2004-08-tol-allithato-magassagu-futomu'),
(762, '', '<strong>Vogtland</strong> magasságállítható futómű szett az OPEL ASTRA számára</p>  \n<ul>  \n    <li><strong>Gyártási év</strong>: 2004-2008</li>  \n    <li><strong>Ültetés mértéke</strong>: 30 - 65 / 20 - 50 mm</li>  \n    <li><strong>Alkalmazható típusok</strong>: Opel Astra H, Typ A-H, Lim. / Sedan, A-H/C, Twin-Top</li>  \n    <li><strong>Elülső tengelyterhelés</strong>: 1070 kg</li>  \n    <li><strong>Hátsó tengelyterhelés</strong>: 1000 kg</li>  \n</ul>  \n<p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. A kitűnő minőségű futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Az első osztályú lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát nyújt az ültetőrugókra és a lengéscsillapítókra!</p>  \n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező- vagy torziós futóművet szereltek.</p>  \n<p>Gyártva Németországban!</p>  \n<p>Cikkszám: 968515</p>', 'Vogtland Opel Astra H Sedan, 2004.03-tól állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-h-sedan-2004-03-tol-allithato-magassagu-futomu'),
(763, '', '<p><strong>JOM BLUE LINE állítható magasságú sport futómű az Opel Astra J számára</strong></p>\n<p>Típuskód: J</p>\n<p>Évjárat: 2008.11-2015</p>\n<p>!! Nem kompatibilis 4WD típusokkal !!</p>\n<p>Tengelyterhelés elöl: 1175 kg</p>\n<p>Tengelyterhelés hátul: 1100 kg</p>\n<p>GYÁRTVA NÉMETORSZÁGBAN</p>\n<p>A futómű teljes mértékben engedéllyel rendelkezik a német TÜV-től, melyet a csomag is tartalmaz.</p>\n<p>2 ÉVES TELJES KÖRŰ GARANCIA!!!</p>\n<p>Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulccsal!</p>\n<p>Kiemelkedő minőség, lenyűgöző áron!!!</p>\n<p>A szett tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</p>\n<p><strong>Jom BlueLine állítható magasságú sport futómű az Opel Astra J modellekhez</strong></p>\n<p>A BlueLine állítható magasságú futóművek magas minőséget képviselnek, melyek mindegyike típusspecifikus. Az autó magassága bármely állítási tartományon belül könnyedén változtatható a speciális állítókulcs segítségével.</p>\n<p>- 19.3 TÜV minősítésű</p>\n<p>- EPS technológiával porfestett és horganyzott alkatrészekkel</p>', 'Jom Bochum Opel Astra J (Typ: P-J), 1.3 CDTi, 1.4, 1.4T, 1.6, 1.7 CDTi, 2.0 CDTi, kivéve 4WD és CDC, 2008.11-2015-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-astra-j-typ-p-j-1-3-cdti-1-4-1-4t-1-6-1-7-cdti-2-0-cdti-kiveve-4wd-es-cdc-2008-11-2015-ig-blue-line-allithato-magassagu-futomu'),
(764, '', '<p>A FK-Automotive által gyártott állítható magasságú sport futómű Opel Astra J modellekhez készült, beleértve a Sports Tourer változatot is. Az évjáratokat tekintve 2009-től használható. A futómű hátsó tengelyén a magasságállító a rugó alatt található. Fontos, hogy a beszereléshez szükséges egy rövidített stabilizátor rúd (kutyacsont), mely nem tartozék a szetthez. Az elülső tengely terhelése 1220 kg, míg a hátsó tengely terhelése 1020 kg. Fontos megjegyezni, hogy a Flexride futóműves modellekhez és az Opel Astra J GTC modellhez ez a futómű nem passzol. A termék Made in Germany minősítéssel rendelkezik, valamint rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 1 év teljeskörű garanciával kapható!</p>', 'FK-Automotive Opel Astra J, 5 ajtós, beleértve Sportsvan, 2009-től állítható magasságú futómű', '', '', '', 'fk-automotive-opel-astra-j-5-ajtos-beleertve-sportsvan-2009-tol-allithato-magassagu-futomu'),
(765, '', '<strong>Opel Astra J V-Maxx állítható magasságú és keménységű futómű</strong><br />Az alábbi modellekhez: 1.4, 1.6, 1.3CDTi, 1.6CDTi, 1.7CDTi, 2.0CDTi, kivéve GTC, OPC<br />Évjárat: 2009.10-2015.09 között<br />Az ültetés mértéke az első tengelyen: 30-70mm<br />Az ültetés mértéke a hátsó tengelyen: 45-70mm<br />Fontos tudnivaló! A futómű beépítéséhez rövidített stabilizátorrudat szükséges használni!<br />A termék TÜV minősítéssel rendelkezik!', 'V-Maxx Opel Astra J, 1.4, 1.6, 1.3CDTi, 1.6CDTi, 1.7CDTi, 2.0CDTi, kivéve GTC, OPC, 2009.10-2015.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-astra-j-1-4-1-6-1-3cdti-1-6cdti-1-7cdti-2-0cdti-kiveve-gtc-opc-2009-10-2015-09-ig-allithato-magassagu-futomu'),
(766, '', '<strong>Opel Astra J GTC V-Maxx állítható magasságú és keménységű futómű</strong><br />Az alábbi modellekhez: 1.4, 1.6, 1.6SIDI, 1.8, 1.6CDTi, 1.7CDTi, 2.0CDTi, 20. Bi-Turbo CDTI<br />Beleértve az OPC változatot<br />Gyártási időszak: 2011. október - 2016. szeptember<br />Az elülső ültetés módosítható: 20-55mm<br />A hátsó ültetés módosítható: 20-55mm<br />Fontos megjegyzés: A futómű beépítéséhez rövidített stabilizátorrúdra van szükség!<br />A termék rendelkezik TÜV minősítéssel!', 'V-Maxx Opel Astra J GTC, 1.4, 1.6, 1.6SIDI, 1.8, 1.6CDTi, 1.7CDTi, 2.0CDTi, 20. Bi-Turbo CDTI, beleértve OPC, 2011.10-2016.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-astra-j-gtc-1-4-1-6-1-6sidi-1-8-1-6cdti-1-7cdti-2-0cdti-20--bi-turbo-cdti-beleertve-opc-2011-10-2016-09-ig-allithato-magassagu-futomu'),
(767, '', '<strong>V-Maxx állítható magasságú és keménységű futómű az Opel Astra J Sports Tourer modellekhez</strong><br /> Az alábbi motorváltozatokhoz: 1.4, 1.6, 1.3CDTi, 1.6CDTi, 1.7CDTi, 2.0CDTi, kivéve GTC, OPC változatokat.<br />Kivéve GTC, OPC típusokat<br />Gyártási időszak: 2009.10-2015.09<br />Elülső ültetés mértéke: 30-70mm<br />Hátsó ültetés mértéke: 45-70mm<br />Fontos! Az alacsonyabb ültetéshez rövidített stabilizátorrúd szükséges!<br />A futómű terméke TÜV minősítéssel rendelkezik!', 'V-Maxx Opel Astra J Sports Tourer, 1.4, 1.6, 1.3CDTi, 1.6CDTi, 1.7CDTi, 2.0CDTi, kivéve GTC, OPC, 2009.10-2015.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-astra-j-sports-tourer-1-4-1-6-1-3cdti-1-6cdti-1-7cdti-2-0cdti-kiveve-gtc-opc-2009-10-2015-09-ig-allithato-magassagu-futomu'),
(768, '', '<strong>Állítható magasságú és keménységű V-Maxx futómű az Opel Astra J Van és Stationwagon modellekhez</strong><br />Ez a futómű ideális választás a következő modellekhez: 1.4, 1.6, 1.3CDTi, 1.6CDTi, 1.7CDTi, 2.0CDTi, kivéve GTC, OPC<br />Kizárólag GTC és OPC modellek kivételével alkalmazható<br />Gyártási időszak: 2009.10-2015.09-ig<br />Elülső ültetés csökkentése: 30-70mm<br />Hátsó ültetés csökkentése: 45-70mm<br />Fontos tudni! Az új futómű beépítéséhez rövidített stabilizátorrudat kell beszerezni!<br />Ez a termék rendelkezik TÜV minősítéssel!', 'V-Maxx Opel Astra J Van és Stationwagon, 1.4, 1.6, 1.3CDTi, 1.6CDTi, 1.7CDTi, 2.0CDTi, kivéve GTC, OPC, 2009.10-2015.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-astra-j-van-es-stationwagon-1-4-1-6-1-3cdti-1-6cdti-1-7cdti-2-0cdti-kiveve-gtc-opc-2009-10-2015-09-ig-allithato-magassagu-futomu'),
(769, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>Opel Astra J GTC Coupé</li>\n	<li>Tipuskód: P-J/SW</li>\n	<li>Évjárat: 2012.01-től</li>\n	<li>Tengelyterhelés elöl (kg): 1180</li>\n	<li>Tengelyterhelés hátul (kg): 930</li>\n	<li>Egyéb kitételek: Csak olyan modellekhez alkalmas, amelyeknél nincs elektronikus lengéscsillapító-vezérlés (EDC).</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Németországban kiadott TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-50 mm, hátul: 25-55 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>', 'AP made by KW Opel Astra J GTC OPC, 2012.06-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-j-gtc-opc-2012-06-tol-allithato-magassagu-futomu'),
(770, '', '<div>\n	<h3>Állítható magasságú futómű az Opel Astra J GTC Coupé autótípushoz</h3>\n	<ul>\n		<li>Tipuskód: P-J/SW</li>\n		<li>Évjárat: 2012.01-től</li>\n		<li>Tengelyterhelés elöl (kg): 1180</li>\n		<li>Tengelyterhelés hátul (kg): 930</li>\n		<li>Egyéb kitételek: Csak olyan modellekhez, melyeknél nincs elektronikus lengéscsillapító-vezérlés (EDC).</li>\n	</ul>\n	<ul>\n		<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n		<li>Az engedélyben meghatározott ültetés mértéke: elöl 20-50 mm, hátul 25-55 mm között állítható. A TÜV engedély csak ezekkel az intervallumokkal érvényes, bár a futómű nagyobb intervallumban is állítható.</li>\n		<li>Lehetséges plusz ültetés: elöl +20 mm, hátul +0 mm</li>\n	</ul>\n	<ul>\n		<li>Termék gyártója: Ap-Fahrwerke, Németország</li>\n		<li>Garancia: 2 év</li>\n	</ul>\n</div>', 'AP made by KW Opel Astra J GTC, 2012.01-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-j-gtc-2012-01-tol-allithato-magassagu-futomu'),
(771, '', '<p>Ez az állítható magasságú futómű a következő Opel Astra J Sports Tourer modellekhez passzol, kivéve azokat, amelyekhez FlexRide futómű tartozik.</p>\n\n<ul>\n	<li>Tipuskód: P-J/SW, P-J/SW/V</li>\n	<li>Évjárat: 2010.10-től</li>\n	<li>Tengelyterhelés elöl (kg): 1190</li>\n	<li>Tengelyterhelés hátul (kg): 1100</li>\n	<li>Egyéb kitételek: Csak olyan modellekhez, amelyeknél nincs elektronikus lengéscsillapító-vezérlés (EDC).</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-70 mm, hátul: 45-75 mm között állítható<br />\n		(Minden esetben ennél nagyobb intervallumban lehet beállítani a futómű magasságát, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>Plussz ültetés lehetőség elöl: +35 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Termék gyártója: Ap-Fahrwerke Németországban</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: GF60-078</strong></p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Opel Astra J Sports Tourer, kivéve FlexRide, 2010.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-j-sports-tourer-kiveve-flexride-2010-10-tol-allithato-magassagu-futomu'),
(772, '', 'Ez az állítható magasságú futómű tökéletes választás az alábbi autótípushoz:</p>  <ul> 	<li>Opel Astra J Limousine, kivéve a FlexRide futóművet</li> 	<li>Tipuskód: P-J</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2008.11-től</li> 	<li>Tengelyterhelés elöl (kg): 1155</li> 	<li>Tengelyterhelés hátul (kg): 1000</li> 	<li>Egyéb kitételek: -</li> </ul>  <ul> 	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés módosítható elöl 40-70 mm, hátul pedig 45-75 mm között<br /> 	(Minden esetben nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti beállításokkal érvényes.)</li> 	<li>Extra ültetési lehetőség elöl: +70 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF60-057</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> ', 'AP made by KW Opel Astra J Limousine, kivéve FlexRide futómű, 2008.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-astra-j-limousine-kiveve-flexride-futomu-2008-11-tol-allithato-magassagu-futomu'),
(773, '', '<p>A Vogtland által készített állítható magasságú futómű szett kifejezetten az Opel Astra J típusú autókhoz lett tervezve, kivéve az OPC és FlexRide modelleket. Ez a futómű szett lehetővé teszi az ültetés mértékének állítását 35-65 / 35-65 mm-es tartományban. Az első tengely maximális terhelése 1060 kg, míg a hátsó tengelyé 840 kg. A futómű szett magában foglal speciális, nagy teljesítményű kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel a kiegyensúlyozott komfort és dinamika érdekében.</p>\n<p>Ez a minőségi termék a korrózió elleni védelemmel ellátott első osztályú lengéscsillapítókat tartalmaz. A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A futómű szett alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel rendelkező autók esetében.</p>\n<p>A Vogtland futómű szett Németországban készült, és a cikkszáma: 968726.</p>', 'Vogtland Opel Astra J Sedan, kivéve OPC és FlexRide, 2008.11-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-j-sedan-kiveve-opc-es-flexride-2008-11-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(774, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett tökéletes választás az OPEL ASTRA 2010-től gyártott típusaihoz. Ez a minőségi futómű szett kiválóan javítja az autó megjelenését és biztosítja a maximális vezetési élményt. Az ültetés mértéke 40-70 / 45-75 mm között állítható, így Ön saját elképzeléseinek megfelelően alakíthatja autója magasságát.</p> \n<p>Az Opel Astra J, Typ P-J, Sports Tourer típusokhoz tervezett futómű kiválóan alkalmas, kivéve a FlexRide változatot. A futómű max. tengelyterhelése elől 1190 kg, míg hátul 1100 kg. Ez a speciális futómű szett két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot.</p> \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező vagy torziós futómű van beépítve.</p> \n<p>Made in Germany!</p> \n<p>Cikkszám: 968754</p>', 'Vogtland Opel Astra J Sports Tourer, kivéve FlexRide, 2010.10-től, (első tengely terhelés 1190kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-opel-astra-j-sports-tourer-kiveve-flexride-2010-10-tol-els-tengely-terheles-1190kg-alatt-allithato-magassagu-futomu'),
(775, '', '<div><strong>Opel Astra J Bilstein B14 sport futómű állítható magassággal</strong></div>  <div> </div>  <div>Az ültetés mértéke az elülső és hátsó tengelyen egyaránt 30-50 mm között állítható</div>  <div> </div>  <div>Az első tengely maximális terhelése 1220 kg, míg a hátsó tengely maximális terhelése 1020 kg</div>  <div> </div>  <div>Ez a termék TÜV engedéllyel rendelkezik, így biztos lehet benne, hogy megfelel az előírásoknak és biztonságosan használható!</div>', 'Bilstein Opel Astra J, kivéve GTC, 2009.12-től Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-opel-astra-j-kiveve-gtc-2009-12-tol-bilstein-b14-allithato-magassagu-futomu'),
(776, '', '<div> <div><strong>Állítható magasságú sport futómű az Opel Astra J GTC modellhez Bilstein B14 típusú</strong></div>  <div> </div>  <div>Elülső ültetés mértéke: 20 - 40 mm</div>  <div>Hátsó ültetés mértéke: 20 - 40 mm</div>  <div> </div>  <div>Elülső tengely terhelhetősége: 1180 kg</div>  <div>Hátsó tengely terhelhetősége: 930 kg</div>  <div> </div>  <div>A futómű megfelel a TÜV előírásainak és rendelkezik engedéllyel!</div> </div>', 'Bilstein Opel Astra J GTC, 2011.10-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-opel-astra-j-gtc-2011-10-tol-bilstein-b14-allithato-magassagu-futomu'),
(777, '', '<p>Egy állítható magasságú sport futómű Opel Corsa B járművekhez.</p>\\r\\n\\r\\n<p>Ez a futómű kifejezetten a 1993.03-2000.09 közötti évekre tervezték.</p>\\r\\n\\r\\n<p>A futómű hátsó tengelyén a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>Az elülső tengely terhelése 820 kg, míg a hátsó tengelyé 700 kg.</p>\\r\\n\\r\\n<p>Ez a termék Németországban készült.</p>\\r\\n\\r\\n<p>Rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban találsz.</p>\\r\\n\\r\\n<p>2 év teljes körű garanciával ellátva!</p>\\r\\n\\r\\n<p>Kiemelkedő minőségű termék, elképesztően jó áron kapható!</p>\\r\\n\\r\\n<p>A szett tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulcsot.</p>\\r\\n\\r\\n<p>Cikkszám: 741002</p>', 'Jom Bochum Opel Corsa A, 1982.10-1995.07-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-corsa-a-1982-10-1995-07-ig-blue-line-allithato-magassagu-futomu'),
(778, '', '<div>\n    <p>Ez az AP-Fahrwerke Állítható magasságú futómû az alábbi autótípushoz illeszkedik:</p>\n    <ul>\n        <li>Opel Corsa A</li>\n        <li>Tipuskód: A-CC</li>\n        <li>Típus variáció:</li>\n        <li>Évjárat: 1983.08 - 1993.02</li>\n        <li>Tengelyterhelés elöl (kg): 680</li>\n        <li>Tengelyterhelés hátul (kg): 665</li>\n        <li>Egyéb kitételek: -</li>\n    </ul>\n    <ul>\n        <li>Ez az állítható futómû Német nyelvű TÜV engedéllyel rendelkezik!</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br />\n            (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n        <li>Plussz ültetés lehetőség elöl: +70 mm, hátul: +0 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: Ap-Fahrwerke, Németország</li>\n        <li>Garancia: 2 év</li>\n    </ul>\n    <p><strong>Cikkszám: </strong>11560041</p>\n    <p><br />\n        Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Opel Corsa A, 1983.08-1993.02-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-a-1983-08-1993-02-ig-allithato-magassagu-futomu'),
(779, '', '<p>A Vogtland állítható magasságú futómű szettet kifejezetten az Opel Corsa modellekhez tervezték, pontosabban az Opel Corsa A, Typ A-CC típusokhoz. Az évjárat 1983-1993 közötti időszakot foglalja magában. Ez a speciális futómű szett lehetővé teszi az ültetés mértékének széles skálájú beállítását, 30-60 mm elöl és 30-50 mm hátul. Fontos adat, hogy az elülső tengelyterhelés maximum 680 kg, míg a hátsó tengelyterhelés maximum 665 kg lehet.</p>\n\n<p>Ez a kiváló minőségű futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem garantálja a maximális vezetési élményt is. A kiegyensúlyozott komfort és fokozott dinamika érdekében a szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően optimális teljesítményt nyújtanak.</p>\n\n<p>A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, így hosszú távon is megőrzik hatékonyságukat. A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n\n<p>A Vogtland futómű szett Made in Germany minőséget képvisel, és a cikkszáma: 968516.</p>', 'Vogtland Opel Corsa A, 1983.08-1993.02-ig állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-a-1983-08-1993-02-ig-allithato-magassagu-futomu'),
(780, '', '<div><strong>Opel Corsa B Bilstein B14 állítható magasságú sport futómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az ültetés mértéke az elülső részen 30 - 50 mm között, míg a hátsó részen 20 - 40 mm között állítható.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely maximális terhelése 820 kg, míg a hátsó tengelyé 700 kg.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel.</div>\\r\\n', 'Bilstein Opel Corsa A, 1982.09-1993.05-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-opel-corsa-a-1982-09-1993-05-ig-bilstein-b14-allithato-magassagu-futomu'),
(781, '', '<p>Az Opel Corsa B JOM BLUE LINE sport futóműve állítható magasságú, mely ideális választás a 1993.03-2000.09 között gyártott típusokhoz. A magasságállító a hátsó tengelyen a rugó alatt található. Az elülső tengely terhelése 820 kg, míg a hátsóé 700 kg. A termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalálsz. Emellett 2 év teljeskörű garanciával érkezik. A futómű kiváló minőségű és rendkívül kedvező áron kapható. A szett tartalmaz 4db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1db kulcsot. Cikkszám: 741002.</p>', 'Jom Bochum Opel Corsa B, 1993.03-2000.09-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-corsa-b-1993-03-2000-09-ig-blue-line-allithato-magassagu-futomu'),
(782, '', '<div><strong>Opel Corsa B FK-Automotive állítható magasságú sport futómű</strong></div> <br>\n<div>Az Opel Corsa B típuskódja B, és gyártása 1993. márciusától 2000. szeptemberéig tartott.</div> <br>\n<div>A futómű hátsó tengelyén a magasságállító a rugó alatt található.</div> <br>\n<div>Az elő tengely terhelése 820 kg, míg a hátsó tengely terhelése 715 kg.</div> <br>\n<div>A futómű Németországban készült, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</div> <br>\n<div>1 év teljes körű garanciával! Kiváló minőségű termék hihetetlenül jó áron!</div> <br>\n<div>A futómű készlet tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot.</div> <br>\n<div>A termék cikkszáma: SMOP8003</div>', 'FK-Automotive Opel Corsa B, 1993.03-2000.09-ig állítható magasságú futómű', '', '', '', 'fk-automotive-opel-corsa-b-1993-03-2000-09-ig-allithato-magassagu-futomu'),
(783, '', '<div>\n    <p>Az AP-Fahrwerke Állítható magasságú futómû tökéletes választás az alábbi autótípushoz:</p>\n    <ul>\n        <li>Opel Corsa B</li>\n        <li>Tipuskód: S93</li>\n        <li>Típus variáció:</li>\n        <li>Évjárat: 1993.03-tól</li>\n        <li>Tengelyterhelés elöl (kg): 840</li>\n        <li>Tengelyterhelés hátul (kg): 720</li>\n        <li>Egyéb kitételek: -</li>\n    </ul>\n    <ul>\n        <li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br />(A futómû ennél nagyobb intervallumban is állítható, de a TÜV engedély csak ezekre az értékekre érvényes.)</li>\n        <li>Plussz ültetés lehetõség elöl: +75 mm, hátul: +0 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: Ap-Fahrwerke Németország</li>\n        <li>Garancia: 2 év</li>\n    </ul>\n    <p>Az ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Opel Corsa B, 1993.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-b-1993-03-tol-allithato-magassagu-futomu'),
(784, '', '<p><strong>Vogtland</strong> által készített állítható magasságú futómű szett az <strong>OPEL CORSA</strong> modellekre. Ez a termék alkalmas az <strong>Opel Corsa B, Typ S93</strong> típusú autókra, melyek gyártási évei 1993 és 2000 között vannak. Az ültetés mértéke 30-60 mm elöl és 30-50 mm hátul.</p>\n<p>A futómű szett maximális vezetési élményt nyújt és javítja az autó megjelenését. A beállítást személyes igényeinek megfelelően végezheti el. A kiváló minőségű futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot.</p>\n<p>A termék rendelkezik <strong>TÜV minősítéssel</strong>, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát biztosít az ültető rugókra és a lengéscsillapítókra.</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p><strong>Made in Germany!</strong></p>\n<p><strong>Cikkszám:</strong> 968517</p>', 'Vogtland Opel Corsa B, 1993.03-tól, Vogtland állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-b-1993-03-tol-vogtland-allithato-magassagu-futomu'),
(785, '', '<div><strong>Állítható magasságú sport futómű az Opel Corsa B-hez Bilstein B14</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az ültetés mértéke az első tengelyen: 30 - 50 mm, míg a hátsó tengelyen: 20 - 40 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely maximális terhelése: 820 kg, míg a hátsó tengelyé: 700 kg</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel!</div>\\r\\n', 'Bilstein Opel Corsa B, 1996.02-2002.12-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-opel-corsa-b-1996-02-2002-12-ig-bilstein-b14-allithato-magassagu-futomu'),
(786, '', '<p>Az Opel Corsa C JOM BLUE LINE sport futóműve állítható magasságú, mely tökéletes választás a 2000.11 - 2006.10 között gyártott típusokhoz. Ez a futómű kifejezetten a 1.0 és 1.2 motorral szerelt modellekhez lett tervezve, és hátsó M10-es menetű lengéscsillapítóval rendelkezik. A magasságállító a hátsó tengelynél a rugó alatt található. A futómű tengelyterhelése elöl 880 kg, míg hátul 760 kg. Ezt a minőségi terméket Németországban gyártották, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 2 év teljeskörű garanciával érkezik! A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot. Ne hagyja ki ezt a kiváló minőségű és megfizethető árú futóművet!</p>', 'Jom Bochum Opel Corsa C, 2000.11-2006.10-ig, (hátul M10-es menettel), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-corsa-c-2000-11-2006-10-ig-hatul-m10-es-menettel-blue-line-allithato-magassagu-futomu'),
(787, '', '<strong>Állítható magasságú sport futómű az Opel Corsa C JOM BLUE LINE modellhez</strong></p>  <p>Az Opel Corsa C JOM BLUE LINE típusú autóhoz készült ez a sport futómű, melyet 2000 novemberétől 2006 októberéig gyártottak. A futómű alkalmas 1.4, 1.8 és 1.7 Diesel motorral szerelt modellekhez, M14 menetű hátsó lengéscsillapítóval felszerelve.</p>  <p>Az állítható magasságú futómű hátsó tengelyén a magasságállító a rugó alatt található. Az elülső tengelyterhelés 880 kg, míg a hátsó tengelyterhelés 760 kg.</p>  <p>Ez a minőségi termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 2 év teljeskörű garanciát biztosítunk rá.</p>  <p>A futómű szett tartalmazza a 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot. Ne hagyja ki ezt a kiváló minőségű terméket, rendkívül kedvező áron!</p> ', 'Jom Bochum Opel Corsa C, 2000.11-2006.10-ig, (hátul M14-es menettel), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-corsa-c-2000-11-2006-10-ig-hatul-m14-es-menettel-blue-line-allithato-magassagu-futomu'),
(788, '', '<div><strong>Állítható magasságú sport futómű Opel Corsa C modellhez</strong></div>\\r\\n\\r\\n<p>Az Opel Corsa C típusú járművekhez készült<br />\\r\\nGyártási időszak: 2000.11 - 2006.10<br />\\r\\nA magasságállító egység a hátsó tengelyen található a rugó alatt.<br />\\r\\nElülső tengely terhelése: 900 kg<br />\\r\\nHátsó tengely terhelése: 760 kg<br />\\r\\nA futómű rendelkezik német TÜV engedéllyel, melyet a csomag tartalmaz.<br />\\r\\n1 ÉV TELJES KÖRŰ GARANCIÁVAL!!!<br />\\r\\nKiemelkedő minőség, rendkívül kedvező áron!!!<br />\\r\\nA csomag tartalma: 4 darab lengéscsillapító a hozzá tartozó rugókkal és egy állítókulccsal</p>\\r\\n', 'FK-Automotive Opel Corsa C, 2000.11-2006.10-ig állítható magasságú futómű', '', '', '', 'fk-automotive-opel-corsa-c-2000-11-2006-10-ig-allithato-magassagu-futomu'),
(789, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választást jelentenek azok számára, akik számára kiemelten fontos a kiváló minőség és az előnyös ár-érték arány. A magasság fokozatmentesen szabályozható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók tökéletes összhangját kínálják.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Az termék rendelkezik TÜV engedéllyel</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Opel Corsa C, 2000.09-2009.12-ig, (hátsó lengéscsillapító M10 menettel) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-corsa-c-2000-09-2009-12-ig-hatso-lengescsillapito-m10-menettel-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(790, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A magasság fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei kiváló egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>a futóművek rugóit az Eibach gyártja</li> <li>a termék rendelkezik TÜV engedéllyel</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiváló hatékonyság extrém igénybevétel esetén is</li> <li>kettős rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> <li>ideális összhang rugó és lengéscsillapító között</li> <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Opel Corsa C, 2000.09-2009.12-ig, (hátsó lengéscsillapító M14 menettel) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-corsa-c-2000-09-2009-12-ig-hatso-lengescsillapito-m14-menettel-allithato-magassagu-futomu'),
(791, '', 'Ez a rugós felfüggesztés tökéletes választás olyan járművekhez, mint az Opel Corsa C. Fontos tudni, hogy ez a futómű csak olyan autókhoz ajánlott, ahol a hátsó lengéscsillapító alsó rögzítése M14-es csavarral történik.<br />Ez a futómű örvend Németországban kiadott TÜV engedélynek, mely meghatározza az ültetési magasságot előre és hátra. Bár a beállításokon belül lehet módosítani az ültetést, érdemes figyelembe venni, hogy a TÜV engedély csak meghatározott időközönként érvényes.<br />A futóművet Németországban, az Ap-Fahrwerke gyárban gyártották, és rá 2 év garancia vonatkozik.<br /><strong>Cikkszám: GF60-012</strong>', 'AP made by KW Opel Corsa C, 2000.07-től, (első tengely terhelés 900kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-c-2000-07-tol-els-tengely-terheles-900kg-alatt-allithato-magassagu-futomu'),
(792, '', '<p>Egy Vogtland állítható magasságú futómű szett, mely megfelel az Opel Corsa C típusú autókhoz (1.0, 1.2, 1.7 D) adataival. Az évjárat 2000. júliusától kezdve érvényes. Az ültetés mértéke 30-60 mm-el csökkenthető elöl és 20-40 mm-el hátul. A maximális tengelyterhelés elöl 900 kg, míg hátul 780 kg. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak. A termék rendelkezik TÜV minősítéssel és 2 év garanciával. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel rendelkező autók esetében. Made in Germany! Cikkszám: 968518.</p>', 'Vogtland Opel Corsa C, 1.0, 1.2, 1.7D, 2000.07-től állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-c-1-0-1-2-1-7d-2000-07-tol-allithato-magassagu-futomu'),
(793, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás az OPEL CORSA típusú autókhoz. Ezt a terméket az évvé század első napjától kezdve használhatja. Az ültetés mértéke rugalmasan beállítható, lehetőséget biztosítva a személyre szabott beállításra. A futómű szett speciális kialakítású, nagy teljesítményű lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortérzetet és dinamikus vezetési élményt nyújtanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak és alacsony nyomású gázrendszerrel vannak ellátva.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég több mint száz éves tapasztalattal rendelkezik a rugógyártás területén. A termékre 2 év garancia vonatkozik, biztosítva a vásárlók számára a biztonságot és megbízhatóságot.</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyek más típusú futóművel vannak felszerelve. A termék Made in Germany minősítéssel rendelkezik, garantálva a magas minőséget és megbízhatóságot.</p>\n<p>Cikkszám: 968519</p>', 'Vogtland Opel Corsa C, 1.4i, 1.8i, 1.3CDTI, 1.7DTi, 1.7CDTi, 2000.07-től állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-c-1-4i-1-8i-1-3cdti-1-7dti-1-7cdti-2000-07-tol-allithato-magassagu-futomu'),
(794, '', '<div>\\r\\n<div><strong>Állítható magasságú sport futómű Opel Corsa C modellekre</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az ültetés mértéke az elülső és hátsó részen is megváltoztatható: az elülső részen 30-50 mm, míg a hátsó részen 20-40 mm.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A futómű első tengelye 900 kg, míg a hátsó tengelye 760 kg terhelést képes elviselni.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a futómű természetesen rendelkezik TÜV engedéllyel is!</div>\\r\\n</div>', 'Bilstein Opel Corsa C, 2000.09-2009.12-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-opel-corsa-c-2000-09-2009-12-ig-bilstein-b14-allithato-magassagu-futomu'),
(795, '', '<ul>\n	<li><strong>Állítható magasságú futómű Opel Corsa D JOM Blueline</strong></li>\n	<li>Évjárat: 2006.08-2014</li>\n	<li>Tengelyterhelés elöl: maximum 1000 kg</li>\n	<li>Tengelyterhelés hátul: maximum 950 kg</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl 35-60 mm, hátul 35-60 mm között állítható. Azonban a futómű minden esetben nagyobb intervallumban is beállítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.</li>\n</ul>', 'Jom Bochum Opel Corsa D, 2006.07-2014-ig állítható magasságú futómű', '', '', '', 'jom-bochum-opel-corsa-d-2006-07-2014-ig-allithato-magassagu-futomu'),
(796, '', '<em>Opel Corsa D-hez állítható magasságú futómű</em><br /><ul><li>Olyan futómű, mely alkalmas különböző Corsa D modellekhez</li><li>Elülső ültetési mérték: 35-70mm, hátsó ültetési mérték: 35-60mm</li><li>Rendelkezik TÜV engedéllyel</li></ul>', 'V-Maxx Opel Corsa D, összes, beleértve GSi, kivéve OPC, 2006.08-2015.01-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-corsa-d-osszes-beleertve-gsi-kiveve-opc-2006-08-2015-01-ig-allithato-magassagu-futomu'),
(797, '', '<strong>Állítható magasságú futómű az Opel Corsa D OPC V-Maxx modellhez</strong>\\n\\n<ul>\\n<li>Opel Corsa D OPC 1.6Turbo</li>\\n<li>Elülső ültetés: 20-55mm</li>\\n<li>Hátsó ültetés: 20-40mm</li>\\n<li>A futómű rendelkezik TÜV engedéllyel</li>\\n</ul>', 'V-Maxx Opel Corsa D OPC, 1.6Turbo, 2006.08-2015.01-ig állítható magasságú futómű', '', '', '', 'v-maxx-opel-corsa-d-opc-1-6turbo-2006-08-2015-01-ig-allithato-magassagu-futomu'),
(798, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az kedvező ár. A futóművek magassága fokozatmentesen állítható, hogy könnyedén alkalmazkodhasson az útviszonyokhoz. Az MTS-Technik futóművei kiváló egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n    <li>A futómű rugóit az Eibach gyártja</li>\n    <li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém igénybevétel mellett is</li>\n    <li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n    <li>Tökéletes összhang rugó és lengéscsillapító között</li>\n    <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Opel Corsa D, 2006.07-2014-ig, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-corsa-d-2006-07-2014-ig-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(799, '', '<div><span>Az Ap futómű a sportosan ambiciózus vezetők számára lehetőséget kínál arra, hogy pontosan beállítsák a kívánt üléspozíciót milliméteres pontossággal. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözését nyújtjuk a maximális ülésmagasság beállításával.</span></div> <div><span>Egy alumínium rugótányér segítségével a jármű magasságát egyéni igények szerint beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság egyidejű összehangolásával optimális konfigurációt biztosítunk.</span></div> <ul>     <li><span>kiváló minőség elérhető áron</span></li>     <li><span>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány<br type=\\\"_moz\\\" />     </span></li>     <li><span>kiemelkedő ár/érték arány<br type=\\\"_moz\\\" />     </span></li>     <li><span>német minőségű</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem!</span></div>', 'AP made by KW Opel Corsa D, 3-4 hengeres, kivéve Diesel, 2006.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-d-3-4-hengeres-kiveve-diesel-2006-10-tol-allithato-magassagu-futomu'),
(800, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára nyújtja azt az lehetőséget, hogy a kívánt ültetést rendkívül precízen beállíthassák. A sportos irányíthatóság és az optimális vezetési viselkedés kombinációját kínáljuk a maximális ültetéssel összekötve.</span></div> <div><span>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban belül. A sportosság, a kényelem és a biztonság párhuzamos összehangolása egy optimális felépítést biztosít.</span></div> <ul>     <li><span>kiváló minőség elérhető áron</span></li>     <li><span>egyéni magasság beállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány<br type=\\\"_moz\\\" />     </span></li>     <li><span>kiemelkedő ár-érték arány<br type=\\\"_moz\\\" />     </span></li>     <li><span>német minőség</span></li> </ul> <div><span>Fontos! Ezen futómű esetében csak a magasság állítható! A keménység nem módosítható!</span></div>', 'AP made by KW Opel Corsa D, 4 hengeres, csak Diesel, 2006.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-d-4-hengeres-csak-diesel-2006-10-tol-allithato-magassagu-futomu'),
(801, '', '<p>A Vogtland állítható magasságú futómű szett célja az Opel Corsa D OPC modell jobb teljesítménye és megjelenése. Az ültetés mértékét egyéni igények szerint állíthatja a megadott értéktartományokon belül. A futómű tartalmaz kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.</p>\n<p>Made in Germany!</p>', 'Vogtland Opel Corsa D OPC, 2007.06-tól állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-d-opc-2007-06-tol-allithato-magassagu-futomu'),
(802, '', '<p>A Vogtland állítható magasságú futómű szett kifejezetten az Opel Corsa D típusú járművekhez lett tervezve, biztosítva ezzel a maximális vezetési élményt. Ennek a minőségi futómű szettnek köszönhetően könnyedén állítható az autó ülésmagassága a kívánt értékek között, így teljes mértékben személyre szabható. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók korrózióvédelme kiváló.</p>\n\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968521</p>', 'Vogtland Opel Corsa D, Diesel, 2006.10-től, (első tengely terhelés 856-990kg) állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-d-diesel-2006-10-tol-els-tengely-terheles-856-990kg-allithato-magassagu-futomu'),
(803, '', '<strong>Vogtland</strong> által állítható magasságú futómű szett az OPEL CORSA számára</p>  \n<ul> 	\n<li><strong>Évjárat</strong>: 2006-tól</li> 	\n<li><strong>Ültetés mértéke</strong>: 25 - 55 / 25 - 55 mm</li> 	\n<li><strong>Típus</strong>: Opel Corsa D, Typ S-D, 3 + 4 hengeres Benzin</li> 	\n<li><strong>Max. tengelyterhelés elõl</strong>: 855 kg</li> 	\n<li><strong>Max. tengelyterhelés hátu</strong>l: 800 kg</li> 	\n<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW400GF16-17_1481-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW400GF16-17_1481-10.pdf</a></li> \n</ul>  \n\n<p>A termék nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A futómű szett lehetővé teszi az ültetés mértékének személyre szabott beállítását. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  \n\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  \n\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  \n\n<p>Made in Germany!</p>  \n\n<p>Cikkszám: 968520</p>  ', 'Vogtland Opel Corsa D, 3-4hengeres, kivéve Diesel, 2006.10-től állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-d-3-4hengeres-kiveve-diesel-2006-10-tol-allithato-magassagu-futomu'),
(804, '', '<ul>\n	<li><strong>Állítható magasságú JOM Blueline futómű az Opel Corsa E-hez</strong></li>\n	<li>2014-től gyártott modellekhez</li>\n	<li>Elülső tengelyterhelés: 1000 kg</li>\n	<li>Hátsó tengelyterhelés: 950 kg</li>\n	<li>A futómű ültetésének szabályozási lehetőségei: elülső részen 20-55 mm, hátsó részen 20-45 mm tartományban állítható<br />\n	(Más beállítások is lehetségesek, de a TÜV engedélyezése kizárólag a fent említett értékekre vonatkozik.)</li>\n</ul>', 'Jom Bochum Opel Corsa E 1.0 Turbo, 1.4 16v, 1.3 CDTi, 2014-től, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-opel-corsa-e-1-0-turbo-1-4-16v-1-3-cdti-2014-tol-blue-line-allithato-magassagu-futomu'),
(805, '', '<em>Állítható magasságú V-Maxx sport futómű az Opel Corsa E modellhez</em><br /><p>Az állítható magasságú V-Maxx sport futómű megfelelő választás különböző Opel Corsa modellekhez.</p><br /><p>Ez a futómű 2014.09-től gyártott járművekhez használható.</p><br /><p>A termék minden fontos TÜV előírást teljesít.</p><br /><p>A futómű elülső ültetési tartománya 35 - 70 mm, míg a hátsó ültetési tartomány 35 - 60 mm.</p><br /><p>Részszám: 60 OP 15</p>', 'V-Maxx Opel Corsa E, 1.0, 1.2, 1.3CDTi, 1.4, 1.4 LPG, 1.4Turbo, 1.6 OPC, 2014.09-től állítható magasságú futómű', '', '', '', 'v-maxx-opel-corsa-e-1-0-1-2-1-3cdti-1-4-1-4-lpg-1-4turbo-1-6-opc-2014-09-tol-allithato-magassagu-futomu'),
(806, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az ár-érték arány. Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li> <li>a magasság skálázható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém igénybevételek esetén is</li> <li>kettős bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> <li>tökéletes harmónia a rugók és a lengéscsillapítók között</li> <li>a készlet könnyen beépíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Opel Corsa E, beleértve Van, 2014.09-től, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-corsa-e-beleertve-van-2014-09-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(807, '', 'Az Opel Corsa E V-Maxx sport futómű egyedülálló<br />Különböző motorváltozatokhoz is ideális<br />Gyártási dátum: 2014.09-től<br />Állítható keménység széles skálán<br />Rendelkezik TÜV engedéllyel<br />Elülső ültetés: 35 - 70 mm között<br />Hátsó ültetés: 35 - 60 mm között<br />Cikkszám: 60 OP 15', 'V-Maxx Opel Corsa E, 1.0, 1.2, 1.3CDTi, 1.4, 1.4 LPG, 1.4Turbo, 1.6 OPC, 2014.09-től, állítható keménységű  állítható magasságú futómű', '', '', '', 'v-maxx-opel-corsa-e-1-0-1-2-1-3cdti-1-4-1-4-lpg-1-4turbo-1-6-opc-2014-09-tol-allithato-kemenysegu--allithato-magassagu-futomu'),
(808, '', 'Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Opel Corsa E OPC</li>\\r\\n	<li>Tipuskód: S-D</li>\\r\\n	<li>Évjárat: 2014.11-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 960</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 800</li>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott előre történő ültetés mértéke: 15-35 mm, hátra: 20-40 mm között állítható<br />\\r\\n	(Bár a futómű nagyobb intervallumban is állítható, a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\\r\\n	<li>További ültetési lehetőség előre: +20 mm, hátra: +10 mm</li>\\r\\n	<li>Készült Ap-Fahrwerke Németországban</li>\\r\\n	<li>2 éves garancia a termékre</li>\\r\\n</ul>\\r\\n', 'AP made by KW Opel Corsa E OPC, 2014.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-e-opc-2014-11-tol-allithato-magassagu-futomu'),
(809, '', '<div><span>A Ap futómű ideális választás a sportosan ambiciózus vezetők számára, akik precízen szeretnék beállítani az ültetést. A maximális ültetést ötvözzük a sportos irányíthatósággal és optimális vezetési viselkedéssel.</span></div> <div><span>Alumínium rugótányér segítségével lehetőség van az egyéni járműmagasság beállítására a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság összehangolása optimális felépítést eredményez.</span></div> <ul>     <li><span>Kiemelkedő minőség megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Fontos figyelmeztetés! Ezen futómű esetében csak a magasság állítható, a keménység nem!</span></div>', 'AP made by KW Opel Corsa E, 2014.11-től, (első tengely terhelés 870kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-e-2014-11-tol-els-tengely-terheles-870kg-alatt-allithato-magassagu-futomu'),
(810, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kínáljuk a maximális ültetéssel kombinálva.</span></div> <div><span>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyát biztosítjuk egy optimális konfigurációval.</span></div> <ul>     <li><span>kiváló minőségű termék megfizethető áron</span></li>     <li><span>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kiemelkedő ár-érték arány</span></li>     <li><span>német minőségű gyártás</span></li> </ul> <div><span>Fontos! Csak a magasság állítható ebben a futóműben, a keménység nem módosítható!</span></div>', 'AP made by KW Opel Corsa E, 2014.11-től, (első tengely terhelés 871-990kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-corsa-e-2014-11-tol-els-tengely-terheles-871-990kg-allithato-magassagu-futomu'),
(811, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás az Opel Corsa E autóhoz, melyet 2014. novemberétől gyártanak. Ez a minőségi kiegészítő nem csupán esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is fokozza. A futómű beállítását egyénileg lehet szabályozni az 25 - 55 mm-es tartományban, az Opel Corsa E, Typ: S-D típusra tervezve. A futómű elbírja az elülső tengelyen 871 - 990 kg, míg a hátsó tengelyen 800 kg maximális terhelést.</p>\n<p>Ez a speciális futómű szett kizárólag kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a hosszú élettartamot.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, melynek több mint 100 éves tapasztalata van a rugók terén, 2 év garanciát biztosít az ültető rugókra és lengéscsillapítókra. Az alapcsomag 4 db ültető rugóból és 4 db lengéscsillapítóból áll, kivéve azoknál az autóknál, melyek szintezővel vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>', 'Vogtland Opel Corsa E, 2014.11-től, (első tengely terhelés 871-990kg) állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-e-2014-11-tol-els-tengely-terheles-871-990kg-allithato-magassagu-futomu'),
(812, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás az Opel Corsa E OPC számára. Ez a minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is kiváló teljesítményt nyújtanak.</p>\n\n<p>Ez az állítható magasságú futómű nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetés mértékét a felhasználó saját elképzelése szerint állíthatja be a 15-35 mm-es ültetés elől és 20-40 mm-es ültetés hátul értékek között.</p>\n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát biztosít az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Opel Corsa E OPC, 2014.11-től állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-e-opc-2014-11-tol-allithato-magassagu-futomu'),
(813, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett tökéletes választás az Opel Corsa E modellekhez, amelyek gyártási éve 2014 novemberétől kezdődik. Ennek az innovatív készletnek az ültetés mértéke 25-55 / 25-55 mm között állítható, és speciálisan a Opel Corsa E Typ: S-D típusú autókhoz lett tervezve.</p> \n\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem garantálja a maximális vezetési élményt is. Az egyedi beállítási lehetőségeknek köszönhetően testre szabhatja az autó üléspozícióját saját igényei szerint. A készlet magas minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező- vagy torziós futóművet szereltek.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Opel Corsa E, 2014.11-től, (első tengely terhelés 870kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-opel-corsa-e-2014-11-tol-els-tengely-terheles-870kg-alatt-allithato-magassagu-futomu'),
(814, '', '<div><span>A Jom BlueLine sportfutóműve egy olyan futómű, amely lehetővé teszi a magasság állítását a járműn. A BlueLine futóművek kiváló minőséget képviselnek, és minden típushoz specifikusak. Az autó magassága könnyedén változtatható egy speciális állítókulcs segítségével.</span><br />\\r\\n<br />\\r\\n<span>Ez a futómű rendelkezik 19.3 TÜV minősítéssel, valamint EPS technológiával porfestett és horganyzott alkatrészekkel.</span><br />\\r\\n<br />\\r\\n<span>Az ár tartalmazza a 4db lengéscsillapítót, 4db rugót és az állításhoz szükséges kulcsot. (Kivéve torziós futóművel szerelt modelleknél)</span></div>', 'Jom Bochum Opel Insignia Sedan és SportTourer, 1.6, 1.6 Turbo, 1.8, 2.0 Turbo, 2.0 CDTI, 2.0 Turbo, 2.8 V6 Turbo, kivéve 4WD, 2008-tól, BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-opel-insignia-sedan-es-sporttourer-1-6-1-6-turbo-1-8-2-0-turbo-2-0-cdti-2-0-turbo-2-8-v6-turbo-kiveve-4wd-2008-tol-blueline-allithato-magassagu-futomu'),
(815, '', '<ul>\\r\\n	<li><strong>FK-Automotive állítható magasságú futómű az Opel Insignia A-hoz</strong></li>\\r\\n	<li>Gyártási év: 2008-2017</li>\\r\\n	<li>Ideértve a SportTourer modellt is</li>\\r\\n	<li>Elülső tengelyterhelés: 1180 kg</li>\\r\\n	<li>Hátsó tengelyterhelés: 1180 kg</li>\\r\\n	<li>Nem tartalmazza az OPC és 4x4 modelleket</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártva Németországban</li>\\r\\n	<li>A futómű rendelkezik német nyelvű TÜV engedéllyel, mely a csomagolásban található</li>\\r\\n	<li>1 éves teljes körű garanciával!</li>\\r\\n	<li>A magasság csökkentése -4 cm és -12 cm között állítható egy állítókulccsal</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!</li>\\r\\n	<li>A szett tartalma: 4 darab lengéscsillapítóval és az ezekhez tartozó rugókkal, valamint az állításhoz szükséges 1 db kulccsal</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Opel Insignia A, beleértve SportTourer, kivéve OPC és 4x4, 2008-2017-ig állítható magasságú futómű', '', '', '', 'fk-automotive-opel-insignia-a-beleertve-sporttourer-kiveve-opc-es-4x4-2008-2017-ig-allithato-magassagu-futomu'),
(816, '', '<ul> 	<li><strong>Állítható magasságú futómű az Opel Vectra C Caravan JOM Blueline modellhez</strong></li> 	<li>Típuskód: C</li> 	<li>Gyártási évek: 2002 - 2008</li> 	<li>Elülső tengelyterhelés: 1230 kg</li> 	<li>Hátsó tengelyterhelés: 1180 kg</li> </ul>  <ul> </ul>  <ul> 	<li>Gyártási hely: NÉMETORSZÁG</li> 	<li>A futómű megfelel a német TÜV engedély követelményeinek, melyet a csomagolás tartalmaz</li> 	<li>2 ÉV TELJES KÖRŰ GARANCIA!!!</li> 	<li>Nagyszerű minőség, rendkívül kedvező áron!!!</li> 	<li>A csomag tartalma: 4 darab lengéscsillapító, hozzájuk tartozó rugókkal, valamint 1 darab állítókulccsal</li> </ul>', 'Jom Bochum Opel Signum, 2003-2008-ig, (első tengely terhelés 1230kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-opel-signum-2003-2008-ig-els-tengely-terheles-1230kg-alatt-allithato-magassagu-futomu'),
(817, '', '<p><strong>Állítható magasságú sport futómű az Opel Vectra C Street Series MTS-Technik-től</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Opel Vectra C Hatchback:</strong> 1.6 / 1.8 16V / 1.8 / 2.0 16V Turbo / 2.2 16V / 2.2DGi / 2.8 V6 Turbo / 3.2 V6 / 1.9CDTI / 2.0DTI 16V / 2.2DTI 16V / 3.0CDTI</li>\\r\\n	<li><strong>Opel Vectra C Limousine:</strong> 1.6 16V / 1.6 / 1.8 / 1.8 16V / 2.0 16V Turbo / 2.2 16V / 2.2DGi / 2.8 V6 Turbo / 2.8 V6 Turbo OPC / 3.2 V6 / 1.9CDTI / 2.0DTI 16V / 2.2DTI 16V / 3.0CDTI</li>\\r\\n	<li><strong>Opel Vectra C Kombi:</strong> 1.6 16V / 1.6 / 1.8 / 2.0 Turbo / 2.2 direct / 2.8 V6 Turbo / 3.2 V6 / 1.9CDTI / 2.0DTI / 2.2DTI / 3.0 V6 CDTI</li>\\r\\n	<li>Ültetés mértéke elöl: 35-65mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-65mm</li>\\r\\n	<li>Első tengely terhelés: 1230kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1140kg</li>\\r\\n	<li>Rugó erősség elöl: 34 - 40 - 70 N/mm</li>\\r\\n	<li>Rugó erősség hátul: 40,2 - 74,8 N/mm</li>\\r\\n	<li>A termék TÜV engedéllyel NEM rendelkezik! (Engedélyeztetése folyamatban)</li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár. A futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóművei kiváló egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Opel Signum, 2003.05-2008.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-signum-2003-05-2008-12-ig-street-series-allithato-magassagu-futomu'),
(818, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: OPEL SIGNUM</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2003.05-től</li>\n    <li><strong>Ültetés mértéke</strong>: 30 - 60 / 30 - 60 mm</li>\n    <li><strong>Típus</strong>: Opel Signum, Typ Z-C/S</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 1230 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1140 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni elképzelések szerint lehet beállítani a megfelelő értékek között. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugók területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugóból és 4 db lengéscsillapítóból áll, kivéve azokat az autótípusokat, melyeknél szintező vagy torziós futómű van szerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968072</p>', 'Vogtland Opel Signum (Typ: Z-C/S), 2003.05-től, (első tengely terhelés 1230kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-opel-signum-typ-z-cs-2003-05-tol-els-tengely-terheles-1230kg-alatt-allithato-magassagu-futomu'),
(819, '', '<p>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára a kívánt ültetés milliméteres pontossággal történő beállítására. A sportos irányíthatóságot és optimális vezetési viselkedést kombinálva a maximális ültetéssel.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyensúlyát optimalizálva.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek megfizethető áron</li>\\r\\n	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>különleges ár/érték arány</li>\\r\\n	<li>német gyártású minőség</li>\\r\\n</ul>', 'AP made by KW Opel Signum (Typ: Z-C/S), 2003.05-től, (első tengely terhelés 1230kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-signum-typ-z-cs-2003-05-tol-els-tengely-terheles-1230kg-alatt-allithato-magassagu-futomu'),
(820, '', '<p>A MTS-Technik által készített sport futóművek ideális választások azok számára, akiknek fontos a kiváló minőség és az elérhető ár. A magasság folyamatosan állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n<li>A rugókat az Eibach gyártja</li>  \n<li>A termék rendelkezik TÜV engedéllyel</li>  \n<li>A magasság szabadon állítható általában 25 és 80 mm között</li>  \n<li>Gáztöltéses lengéscsillapítók</li>  \n<li>Magas hatékonyság extrém igénybevétel esetén is</li>  \n<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében</li>  \n<li>A készlet könnyen telepíthető, nem szükséges módosítás az autó felfüggesztésén</li>  \n</ul> ', 'MTS-Technik by Nord Performance Opel Tigra Twintop, 2004-2010.08-ig, (hátsó lengéscsillapító M14 menettel) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-tigra-twintop-2004-2010-08-ig-hatso-lengescsillapito-m14-menettel-allithato-magassagu-futomu'),
(821, '', 'Hiba történt az API hívás során', 'MTS-Technik by Nord Performance Opel Tigra Twintop, 2004-2010.08-ig, (hátsó lengéscsillapító M10 menettel) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-tigra-twintop-2004-2010-08-ig-hatso-lengescsillapito-m10-menettel-allithato-magassagu-futomu'),
(822, '', '<p>Ez a módosítható magasságú AP-Fahrwerke futómű az alábbi autótípushoz alkalmas:</p>\n\n<ul>\n	<li>Autótípus: Opel Corsa A</li>\n	<li>Tipuskód: A-CC</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1983.08 - 1993.02</li>\n	<li>Tengelyterhelés elöl (kg): 680</li>\n	<li>Tengelyterhelés hátul (kg): 665</li>\n	<li>Egyéb információk: -</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Extra ültetési lehetőség elöl: +70 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németországban készült</li>\n	<li>Garancia: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11560041</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Opel Tigra (S93 Coupé), 1994.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-tigra-s93-coupe-1994-09-tol-allithato-magassagu-futomu'),
(823, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás az Opel Tigra típusú autókhoz, évjárat 1994-2000. Ez a minőségi futómű szett maximális vezetési élményt nyújt, miközben javítja az autó megjelenését. Az ültetés mértéke 30-60 mm elöl és 30-50 mm hátul állítható a megfelelő értékek között. A szett tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is optimális teljesítményt nyújtanak.</p>\n\n<p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A termék alapesetben 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968522</p>', 'Vogtland Opel Tigra, 1994.09-2000-ig állítható magasságú futómű', '', '', '', 'vogtland-opel-tigra-1994-09-2000-ig-allithato-magassagu-futomu'),
(824, '', '<ul>\n	<li><strong>Állítható magasságú futómű Opel Vectra B JOM BlueLine kivitelben</strong></li>\n	<li>Típuskód: J96</li>\n	<li>Évjárat: 1995.10 - 2002.02</li>\n	<li> </li>\n	<li>Alkalmazható Caravan típusokhoz is</li>\n	<li>Tengelyterhelés elöl: 1055 kg</li>\n	<li>Tengelyterhelés hátul: 1025 kg</li>\n</ul>\n\n<ul>\n</ul>\n\n<ul>\n	<li>Gyártás helye: NÉMETORSZÁG</li>\n	<li>A futómű megfelel a német TÜV előírásainak, melyről a csomagolás tanúsítványt tartalmaz</li>\n	<li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\n	<li>A futómű magassága -4 cm és -12 cm között állítható egy állítókulccsal</li>\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\n	<li>A csomag tartalma: 4 darab lengéscsillapító, hozzájuk tartozó rugókkal és az állítókulcs</li>\n</ul>', 'Jom Bochum Opel Vectra B, beleértve Caravan, 1995.10-2002.02-ig, BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-opel-vectra-b-beleertve-caravan-1995-10-2002-02-ig-blueline-allithato-magassagu-futomu'),
(825, '', '<ul>\n	<li><strong>FK-Automotive állítható magasságú futómű az Opel Vectra B-hez</strong></li>\n	<li>Típuskód: J96</li>\n	<li>Évjárat: 1995.10 - 2002.02</li>\n	<li>Beleértve Caravan</li>\n	<li>Tengelyterhelés elöl: 1055 kg</li>\n	<li>Tengelyterhelés hátul: 1025 kg</li>\n</ul>\n\n<ul>\n</ul>\n\n<ul>\n	<li>Gyártás helye: NÉMETORSZÁG</li>\n	<li>A futómű megfelel a német TÜV előírásainak, melyről a csomagolás tanúsítványt tartalmaz.</li>\n	<li>1 ÉV TELJES GARANCIÁVAL!!!</li>\n	<li>A futómű ültetése -4 cm és -12 cm között állítható egy állítókulccsal!</li>\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\n	<li>A szett tartalma: 4 darab lengéscsillapító a hozzá tartozó rugókkal és 1 darab állítókulccsal</li>\n</ul>', 'FK-Automotive Opel Vectra B, beleértve Caravan, 1995.10-2002.02-ig állítható magasságú futómű', '', '', '', 'fk-automotive-opel-vectra-b-beleertve-caravan-1995-10-2002-02-ig-allithato-magassagu-futomu'),
(826, '', '<strong>Opel Vectra B AP állítható magasságú futómû</strong></p>  <p>Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy pontosan beállíthassa az általa kívánt ülésmagasságot. A sportos irányíthatóságot és optimális vezetési tulajdonságokat ötvözve kínáljuk maximális ülésmagassággal.</p>  <p>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, a kényelem és a biztonság összehangolása egy optimális felépítést eredményez.</p>  <ul> 	<li>kiváló minőségű termék megfizethető áron</li> 	<li>egyéni magasság beállítás TÜV engedélyezett tartományon belül</li> 	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>egyedülálló ár/érték arány</li> 	<li>német minőségű</li> </ul>', 'AP made by KW Opel Vectra B, 1995.10-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-vectra-b-1995-10-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(827, '', '<strong>Opel Vectra B AP állítható magasságú futómű</strong></p>  <p>Az AP futómű lehetőséget biztosít a sportosan vezetésre vágyóknak, hogy a jármű ültetését milliméterre precízen beállíthassák. Ennek eredményeként a sportos irányíthatóság és a kiváló vezetési tulajdonságok összhangban vannak, miközben maximalizálják az ültetést.</p>  <p>A járműmagasság beállításához alumínium rugótányér szolgál, mely lehetővé teszi az egyéni beállítást a TÜV által engedélyezett tartományban. Ennek eredményeként a sportosság, a kényelem és a biztonság tökéletes egyensúlyban van, és optimális vezetési élményt nyújt.</p>  <ul> 	<li>kiváló minőségű alkatrészek megfizethető áron</li> 	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományban</li> 	<li>minőségi alkatrészek és TÜV tanúsítvány</li> 	<li>kivételes ár-érték arány</li> 	<li>német minőségű</li> </ul>', 'AP made by KW Opel Vectra B, 1995.10-től, (első tengely terhelés 951-1055kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-vectra-b-1995-10-tol-els-tengely-terheles-951-1055kg-ig-allithato-magassagu-futomu'),
(828, '', '<p><strong>Vogtland</strong> általános emelhető futómű szett: OPEL VECTRA</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1995-2003</li>\n	<li><strong>Ültetés mértéke</strong>: 35 - 60 / 35 - 75 mm</li>\n	<li><strong>Típus</strong>: Opel Vectra B, Typ J96, J96, Lim. / Sedan, Caravan</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 950 kg alatt</li>\n	<li><strong>Max. tengelyterhelés hátu</strong>l: 1025 kg</li>\n</ul>\n<p>Ezen kiegészítő javítja az autó külső megjelenését, és fokozza a vezetési élményt. Az ültetés mértékét egyéni elképzelésének megfelelően állíthatja be. Ez a minőségi futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortérzetet és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiválóan ellenállnak a korróziónak.</p>\n<p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p>\n<p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező vagy torziós futóművet szereltek fel.</p>\n<p>Németországban készült!</p>\n<p>Cikkszám: 968341</p>', 'Vogtland Opel Vectra B, beleértve Caravan, 1995.10-től, (első tengely terhelés: 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-opel-vectra-b-beleertve-caravan-1995-10-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(829, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett alkalmas az Opel Vectra típusú autókhoz, az évek során 1995 és 2003 között gyártott modellekre. Ez a minőségi futómű szett lehetővé teszi az autó megjelenésének javítását, miközben optimális vezetési élményt nyújt. A futómű beállítását a felhasználó saját elképzeléseinek megfelelően lehet elvégezni a megfelelő paraméterek között. Az állítható ültetés mértéke 35-60 mm elöl és 35-75 mm hátul.\n\nEz a speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítva a kiegyensúlyozott komfortot és dinamikus vezetési élményt. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó teljesítményének növeléséhez.\n\nA termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.\n\n\"A termék Made in Germany\" és a cikkszám: 968342.</p>', 'Vogtland Opel Vectra B, beleértve Caravan, 1995.10-től, (első tengely terhelés: 951kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-opel-vectra-b-beleertve-caravan-1995-10-tol-els-tengely-terheles-951kg-folott-allithato-magassagu-futomu'),
(830, '', '<ul> 	<li><strong>JOM Blueline állítható magasságú futómű az Opel Vectra C Sedanhoz</strong></li> 	<li>Típuskód: C</li> 	<li>Gyártási időszak: 2002 - 2008</li> 	<li>Elülső tengelyterhelés: 1230 kg</li> 	<li>Hátsó tengelyterhelés: 1180 kg</li> </ul>  <ul> </ul>  <ul> 	<li>Gyártási hely: NÉMETORSZÁG</li> 	<li>A futómű megfelel a német TÜV engedély követelményeinek, melyet a csomagolásban talál</li> 	<li>2 ÉVES TELJES GARANCIÁVAL!!!</li> 	<li>Kiemelkedő minőség, rendkívül versenyképes áron!!!</li> 	<li>A csomag tartalmazza: 4 darab lengéscsillapítót a hozzá tartozó rugókkal és 1 darab beállító kulccsal</li> </ul>', 'Jom Bochum Opel Vectra C Sedan, 2002-2008-ig, (első tengely terhelés 1230kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-opel-vectra-c-sedan-2002-2008-ig-els-tengely-terheles-1230kg-alatt-allithato-magassagu-futomu'),
(831, '', '<ul> 	<li><strong>JOM Blueline állítható magasságú futómű az Opel Vectra C Caravanhoz</strong></li> 	<li>Típuskód: C</li> 	<li>Évjárat: 2002 - 2008</li> 	<li>Tengelyterhelés elöl: 1230 kg</li> 	<li>Tengelyterhelés hátul: 1180 kg</li> </ul>  <ul> </ul>  <ul> 	<li>Gyártási hely: NÉMETORSZÁG</li> 	<li>A futómű megfelel a német nyelvű TÜV engedély követelményeinek, amelyet a csomagolás tartalmaz</li> 	<li>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</li> 	<li>Kiemelkedő minőség, elképesztően jó áron!!!</li> 	<li>A csomag tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</li> </ul> ', 'Jom Bochum Opel Vectra C Caravan, 2003-2008-ig, (első tengely terhelés 1230kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-opel-vectra-c-caravan-2003-2008-ig-els-tengely-terheles-1230kg-alatt-allithato-magassagu-futomu'),
(832, '', '<p><strong>MTS-Technik állítható magasságú sport futómű Opel Vectra C Street Serieshez</strong></p>\n\n<ul>\n	<li>Opel Vectra C Hatchback: 1.6 / 1.8 16V / 1.8 / 2.0 16V Turbo / 2.2 16V / 2.2DGi / 2.8 V6 Turbo / 3.2 V6 / 1.9CDTI / 2.0DTI 16V / 2.2DTI 16V / 3.0CDTI</li>\n	<li>Opel Vectra C Limousine: 1.6 16V / 1.6 / 1.8 / 1.8 16V / 2.0 16V Turbo / 2.2 16V / 2.2DGi / 2.8 V6 Turbo / 2.8 V6 Turbo OPC / 3.2 V6 / 1.9CDTI / 2.0DTI 16V / 2.2DTI 16V / 3.0CDTI</li>\n	<li>Opel Vectra C Kombi: 1.6 16V / 1.6 / 1.8 / 2.0 Turbo / 2.2 direct / 2.8 V6 Turbo / 3.2 V6 / 1.9CDTI / 2.0DTI / 2.2DTI / 3.0 V6 CDTI</li>\n	<li>Ültetés mértéke elöl: 35-65mm</li>\n	<li>Ültetés mértéke hátul: 35-65mm</li>\n	<li>Első tengely terhelés: 1230kg</li>\n	<li>Hátsó tengely terhelés: 1140kg</li>\n	<li>Rugó erősség elöl: 34 - 40 - 70 N/mm</li>\n	<li>Rugó erősség hátul: 40,2 - 74,8 N/mm</li>\n	<li>A termék TÜV engedéllyel NEM rendelkezik! (Engedélyeztetése folyamatban)</li>\n</ul>\n\n<p>A MTS-Technik állítható magasságú sport futóművek ideális választás azok számára, akik kiváló minőséget és megfizethető árat keresnek! Az állítható magasság fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság legtöbb esetben 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Vectra C, 2002.08-2009.01-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-vectra-c-2002-08-2009-01-ig-street-series-allithato-magassagu-futomu'),
(833, '', 'Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy precízen beállíthassák a kívánt ültetést. Az optimális vezetési tulajdonságokat és sportos irányíthatóságot maximalizáló ültetést biztosítunk.</p>  <p>A járműmagasság egyénileg beállítható egy alumínium rugótányér segítségével a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság ideális kombinációját nyújtjuk, biztosítva ezzel az optimális felépítést.</p>  <ul> 	<li>kiváló minőség elérhető áron</li> 	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</li> 	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>kimagasló ár-érték arány</li> 	<li>német minőségű termékek</li> </ul>', 'AP made by KW Opel Vectra C Sedan, 2002.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-vectra-c-sedan-2002-04-tol-allithato-magassagu-futomu'),
(834, '', '<p>A Vogtland állítható magasságú futómű szett megfelel az Opel Vectra C Caravan 2003-tól gyártott típusainak. A futómű lehetőséget biztosít az ültetés mértékének széles skálájú beállítására, így javítva az autó megjelenését és növelve a vezetési élményt. A speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel, amelyek kiegyensúlyozott komfortérzetet és fokozott dinamikát nyújtanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek első osztályú minőségben.</p>\n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak szerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968073</p>', 'Vogtland Opel Vectra C Caravan, 2003.10-től állítható magasságú futómű', '', '', '', 'vogtland-opel-vectra-c-caravan-2003-10-tol-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(835, '', '<p><strong>Vogtland</strong> által kifejlesztett állítható magasságú futómű szett az OPEL VECTRA C Sedan modellhez.</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2002-től</li>\n	<li><strong>Ültetés mértéke</strong>: 40 - 70 / 25 - 55 mm</li>\n	<li><strong>Típus</strong>: Opel Vectra C, Typ Vectra C / Lim. / Sedan</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1190 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 985 kg</li>\n</ul>\n<p>A Vogtland futómű szett nem csupán esztétikailag javítja az autó megjelenését, hanapság a vezetési élményt is fokozza. A beállítható ültetési magasság lehetőséget ad arra, hogy az autót személyes igényeidhez igazítsd. A futómű tartalmaz kiváló minőségű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus teljesítményt biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968071</p>', 'Vogtland Opel Vectra C Sedan, 2002.04-től állítható magasságú futómű', '', '', '', 'vogtland-opel-vectra-c-sedan-2002-04-tol-allithato-magassagu-futomu'),
(836, '', '<p>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ültetést. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját nyújtjuk a maximális ültetéssel egyesítve.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg be lehet állítani a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyát biztosítjuk egy optimális felépítéssel.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>különleges ár-érték arány</li>\\r\\n	<li>német minőségű</li>\\r\\n</ul>', 'AP made by KW Opel Vectra C Caravan, 2003.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-opel-vectra-c-caravan-2003-10-tol-allithato-magassagu-futomu'),
(837, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és lengéscsillapítók között.</p>\n\n<p><u>Kompatibilis típusok:</u></p>\n<ul>\n	<li>Opel Zafira A, 1.6 CNG / 1.6 16V / 1.6 LPG / 1.6 / 1.8 16V / 2.0 OPC / 2.2 16V / 2.0 DI 16V / 2.0 DTI 16V / 2.2 DTI 16V</li>\n	<li>Ültetés mértéke elöl: 20-55mm</li>\n	<li>Ültetés mértéke hátul: 40-75mm</li>\n	<li>Első tengely terhelés: 1075kg</li>\n	<li>Hátsó tengely terhelés: 1055kg</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Zafira A, 1999.04-2005.06-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-zafira-a-1999-04-2005-06-ig-street-series-allithato-magassagu-futomu'),
(838, '', '<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azok számára, akik szeretnék kombinálni a sportos megjelenést az utazási kényelemmel. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik Comfort futóművei tökéletes egyensúlyban állnak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p>  \n\n<p><u>Az alábbi típusokhoz alkalmas:</u></p>\n<ul>\n	<li>Opel Zafira A, 1.6 CNG / 1.6 16V / 1.6 LPG / 1.6 / 1.8 16V / 2.0 OPC / 2.2 16V / 2.0 DI 16V / 2.0 DTI 16V / 2.2 DTI 16V</li>\n	<li>Ültetés mértéke elöl: 20-55mm</li>\n	<li>Ültetés mértéke hátul: 40-75mm</li>\n	<li>Első tengely terhelés: 1075kg</li>\n	<li>Hátsó tengely terhelés: 1055kg</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort Series célja a magas kényelem, nem az extrém ültetés</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszú élettartamért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Zafira A, 1999.04-2005.06-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-zafira-a-1999-04-2005-06-ig-comfort-series-allithato-magassagu-futomu'),
(839, '', '<p><strong>MTS-Technik Sport állítható magasságú futómű Opel Zafira A-hoz</strong></p>\n<p><u>Kompatibilis típusok:</u></p>\n<ul>\n	<li>1.6 CNG / 1.6 16V / 1.6 LPG / 1.6 / 1.8 16V / 2.0 OPC / 2.2 16V / 2.0 DI 16V / 2.0 DTI 16V / 2.2 DTI 16V</li>\n	<li>Elülső ültetés: 20-55mm</li>\n	<li>Hátsó ültetés: 35-65mm</li>\n	<li>Elülső tengely terhelés: 1075kg</li>\n	<li>Hátsó tengely terhelés: 1055kg</li>\n</ul>\n<p>A <strong>MTS-Technik Sport Series futóművei</strong> ideális választás azoknak, akik maximális teljesítményt és rugalmasságot keresnek. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó alvázának könnyű beállítását az útviszonyoknak megfelelően. Az <strong>MTS-Technik Sport futóművei</strong> optimális egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik</strong> lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a sportosság érdekében</li>\n	<li>A <strong>Sport Series</strong> kialakításakor a fokozott vezetési élmény mellett a széles ültetési tartomány volt a fő szempont</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Opel Zafira A, 1999.04-2005.06-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-opel-zafira-a-1999-04-2005-06-ig-sport-series-allithato-magassagu-futomu'),
(840, '', '</div> \\n<p>Ez az alkatrész ideális opció lehet a Renault Clio B V-Maxx modellhez, mivel állítható magassággal rendelkezik és sportos teljesítményt nyújt. A Renault Clio B V-Maxx tulajdonosai biztosan örömüket lelik majd a javult vezetési élményben és a dinamikusabb megjelenésben, amit ez az alkatrész biztosít.</p>', 'V-Maxx Renault Clio B, 2.0 16V Cup 182Le, 2004.01-2005-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-clio-b-2-0-16v-cup-182le-2004-01-2005-ig-allithato-magassagu-futomu'),
(841, '', '<div> \\n<p>\\n<strong>\\nA Renault Clio B-hez tervezett állítható magasságú sport futómű, amely javítja a teljesítményt és növeli a vezetési élményt.\\n</strong>\\n</p>', 'V-Maxx Renault Clio B, 2.0 16V 169Le, 1998.03-2004-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-clio-b-2-0-16v-169le-1998-03-2004-ig-allithato-magassagu-futomu'),
(842, '', '<p>Egy állítható magasságú sport futómű, mely kifejezetten a Renault Clio B számára lett tervezve. Kompatibilis többféle motortípussal, kivéve a 2.0 16V és 2.0 16V Sport változatokat. A futómű TÜV engedéllyel rendelkezik, biztosítva ezzel a megfelelő minőséget és biztonságot.</p>\n\n<p>Az Ap futómű lehetővé teszi a sportos vezetők számára, hogy milliméter pontosan beállítsák az autó ültetését. Ezáltal optimális irányíthatóságot és vezetési élményt biztosítva. Az alumínium rugótányér segítségével könnyedén beállítható a jármű magassága a TÜV által engedélyezett tartományon belül, így a sportosság, kényelem és biztonság tökéletes egyensúlyban lesz.</p>\n\n<ul>\n	<li>Kiemelkedő minőség, megfizethető áron</li>\n	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\n	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>Kiemelkedő ár/érték arány</li>\n	<li>Német minőség</li>\n</ul>', 'AP made by KW Renault Clio B, kivéve 2.0 16V, 1998.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-clio-b-kiveve-2-0-16v-1998-09-tol-allithato-magassagu-futomu'),
(843, '', '<strong>Állítható magasságú sport futómű a RENAULT Clio B modellhez</strong></p>\\r\\n\\r\\n<p>Az AP futómű lehetővé teszi a sportosan vezetni vágyóknak, hogy milliméterre beállítsák az általuk kívánt ülésmagasságot. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kínálva maximális ültetéssel.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg szabályozhatjuk a TÜV által engedélyezett tartományban belül. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű alkatrészek megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által jóváhagyott tartományban</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőségű</li>\\r\\n</ul>\\r\\n', 'AP made by KW Renault Clio B, 2.0i 16V, 2.0 16V Sport, 2000.02-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-clio-b-2-0i-16v-2-0-16v-sport-2000-02-tol-allithato-magassagu-futomu'),
(844, '', '<p>A Vogtland által készített állítható magasságú futómű szett megfelel a RENAULT CLIO 1998.09-től gyártott modelleire. Az ültetés mértéke 35-65/30-50 mm között állítható. Ez a futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú élettartamúak. A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapesetben 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968345</p>', 'Vogtland Renault Clio (Typ: B), 27mm furat távolság, 1998.09-től állítható magasságú futómű', '', '', '', 'vogtland-renault-clio-typ-b-27mm-furat-tavolsag-1998-09-tol-allithato-magassagu-futomu'),
(845, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás lehet a RENAULT CLIO autókhoz. Ez a minőségi termék lehetővé teszi az autó megjelenésének javítását és maximalizálja a vezetési élményt. Az ültetés mértékét a 35-65 mm-es tartományban lehet állítani, így mindenki megtalálhatja a számára legmegfelelőbb beállítást. A futómű tartalmaz nagyteljesítményű kétcsöves lengéscsillapítókat, amelyek gondoskodnak a kiegyensúlyozott komfortról és a fokozott dinamikáról. Emellett kiváló korrózióvédelemmel rendelkeznek. </p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat. </p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968346</p>', 'Vogtland Renault Clio (Typ: B), 23mm furat távolság, 1998.09-től állítható magasságú futómű', '', '', '', 'vogtland-renault-clio-typ-b-23mm-furat-tavolsag-1998-09-tol-allithato-magassagu-futomu'),
(846, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: RENAULT CLIO</p>  <ul> 	<li><strong>Évjárat</strong>: 2000.02-től</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 60 / 15 - 30 mm</li> 	<li><strong>Típus</strong>: Renault Clio II, Typ B, 2.0i 16V (Sport), 2004-ig</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 860 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 785 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett ez a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968347</p> ', 'Vogtland Renault Clio (Typ: B), 2.0i 16V (Sport), 2000.02-től állítható magasságú futómű', '', '', '', 'vogtland-renault-clio-typ-b-2-0i-16v-sport-2000-02-tol-allithato-magassagu-futomu'),
(847, '', '<p><strong>Renault Clio C V-Maxx állítható magasságú futóművel</strong></p>\n<ul>\n  <li> 1.2 16V / 1.2 Ethanol / 1.4 16V / 1.6 16V / 1.5dCi</li>\n  <li>Kivéve Facelift, 2.0 16V és Grantour</li>\n  <li>Elülső ültetés: 35-70mm</li>\n  <li>Hátsó ültetés: 30-60mm</li>\n  <li>Ez az autóalkatrész rendelkezik TÜV engedéllyel</li>\n</ul>', 'V-Maxx Renault Clio C (Typ: R), kivéve Facelift, 2.0 16V, Grantour, 2005.06-2010.06-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-clio-c-typ-r-kiveve-facelift-2-0-16v-grantour-2005-06-2010-06-ig-allithato-magassagu-futomu'),
(848, '', '<p><strong>Renault Clio C V-Maxx állítható magasságú futómű</strong></p>\n<ul>\n<li>1.2 16V / 1.2 Ethanol / 1.4 16V / 1.6 16V / 1.5dCi</li>\n<li>Csak az újított modellek esetében érhető el</li>\n<li>Kivétel 2.0 16V és Grantour</li>\n<li>Elülső ültetés mértéke: 35-70mm</li>\n<li>Hátsó ültetés mértéke: 30-60mm</li>\n<li>Az alkatrész rendelkezik TÜV engedéllyel</li>\n</ul>', 'V-Maxx Renault Clio C (Typ: R) Facelift, kivéve 2.0 16V és Grantour, 2010.07-2012.10-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-clio-c-typ-r-facelift-kiveve-2-0-16v-es-grantour-2010-07-2012-10-ig-allithato-magassagu-futomu'),
(849, '', '<p>Ez az állítható magasságú futómű kompatibilis a Renault Clio 3 autótípushoz, beleértve a Grandtour-t is. A futóműnek 33mm-es első toronyfurat átmérője van. A tipuskódja R, és az évjárata 2010.08-tól. A tengelyterhelés elől 951-1000 kg, míg hátul 890 kg. Egyéb kitételek: -</p>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elől 40-70 mm, hátul 40-70 mm között állítható (a futómű nagyobb intervallumban is állítható, de a TÜV engedély csak az említett beállításokra vonatkozik).</li>\n	<li>Plussz ültetés lehetőség elől: +15 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>2 év garancia a termékre</li>\n</ul>\n\n<p><strong>Cikkszáma: </strong>11590032</p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Renault Clio C, 2010.08-tól, első torony furat 33mm, (első tengely terhelés 951-1000kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-clio-c-2010-08-tol-els-torony-furat-33mm-els-tengely-terheles-951-1000kg-allithato-magassagu-futomu'),
(850, '', '<p>Ez a moduláris AP-Fahrwerke állítható magasságú futómű megfelel a következő Renault Clio 3 típusokhoz: Grandtour. Az első toronyfurat átmérője 33mm. A tipuskód R, a típus variáció pedig 2010.08-tól érvényes. Az elő tengelyterhelése 950 kg, míg a hátsóé 890 kg. Egyéb kitételek: -</p>\n\n<ul>\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n	<li>A TÜV engedély által meghatározott ültetési tartományok: elöl 40-70 mm, hátul 40-70 mm között állítható. Emellett lehetséges további ültetés elöl: +15 mm, hátul: +0 mm.</li>\n</ul>\n\n<ul>\n	<li>Gyártó: AP-Fahrwerke Németországban.</li>\n	<li>Termékgarancia: 2 év.</li>\n</ul>\n\n<p><strong>Cikkszám:</strong> 11590023</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Renault Clio C, 2010.08-tól, első torony furat 33mm, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-clio-c-2010-08-tol-els-torony-furat-33mm-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(851, '', '<p><strong>Vogtland</strong> által gyártott állítható magasságú futómű szett Renault Clio III, Clio Grantour, Typ R típusú autókhoz (kivéve RS) az évekre 2005-2010. Az ültetés mértéke 40 - 70 / 40 - 70 mm között állítható. A maximális tengelyterhelés elöl 950 kg, míg hátul 890 kg. A futómű szett minőségi kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, biztosítva ezzel a kiegyensúlyozott komfortot és fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók javítják az autó megjelenését és garantálják a maximális vezetési élményt.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett tartalma alapvetően 4 db ültető rugó és 4 db lengéscsillapító, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968348</p>', 'Vogtland Renault Clio C (Typ: R), beleértve Grantour, kivéve RS, 2005.10-től, (első tengely terhelés 950kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-renault-clio-c-typ-r-beleertve-grantour-kiveve-rs-2005-10-tol-els-tengely-terheles-950kg-alatt-allithato-magassagu-futomu'),
(852, '', '<strong>Állítható magasságú futómű a Renault Clio D V-Maxx-hoz</strong><br /><br /><ul><br /><li>A futómű alkalmazható a Clio 1.2LPG 16V, 1.2TCe és 1.5dCi modellekre</li><br /><li>Nem kompatibilis az 09.TCe és Grantour modellekkel</li><br /><li>Az elülső ültetés magassága állítható 35-70mm között</li><br /><li>A hátsó ültetés magassága állítható 30-60mm között</li><br /><li>A futómű TÜV engedéllyel rendelkezik</li><br /></ul><br />', 'V-Maxx Renault Clio D, 1.2LPG 16V, 1.2TCe, 1.5dCi, kivéve 0.9TCe és Grantour modellek, 2012.11-től állítható magasságú futómű', '', '', '', 'v-maxx-renault-clio-d-1-2lpg-16v-1-2tce-1-5dci-kiveve-0-9tce-es-grantour-modellek-2012-11-tol-allithato-magassagu-futomu'),
(853, '', '<em>A Renault Clio D RS V-Maxx modell állítható magasságú futóművel</em>\\n<ul>\\n<li>A jármű motorja 147 vagy 162 kilowatt teljesítményre képes</li>\\n<li>Nem kompatibilis a Facelift, 2.0 16V és Grantour modellekkel</li>\\n<li>Az ültetés mértéke az első tengelyen 30-70 mm között, míg a hátsó tengelyen 20-50 mm között állítható</li>\\n<li>Ez a termék rendelkezik TÜV engedéllyel</li>\\n</ul>', 'V-Maxx Renault Clio D, 1.6 RS, 1.6 RS Trophy, 2012.11-től állítható magasságú futómű', '', '', '', 'v-maxx-renault-clio-d-1-6-rs-1-6-rs-trophy-2012-11-tol-allithato-magassagu-futomu'),
(854, '', '</div>\\n<p></p>\\n<div><strong>Állítható magasságú sport futómű kapható a Renault Megane V-Maxx modellhez</strong></div>', 'V-Maxx Renault Megane, 1996.01-2001-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-megane-1996-01-2001-ig-allithato-magassagu-futomu'),
(855, '', '<div>\n  <p><em>A magassága állítható egyedi sport futómű</em></p>\n</div>', 'V-Maxx Renault Megane 2 (Typ: M), 2002-2009-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-megane-2-typ-m-2002-2009-ig-allithato-magassagu-futomu'),
(856, '', '<div><strong>Állítható magasságú sport futómű a Renault Megane RS-hez Bilstein B14 lengéscsillapítókkal</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az ültetés mértéke az első és hátsó tengelyen egyaránt 10-30 mm között állítható</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely maximális terhelése: 1102 kg, míg a hátsó tengelyé 855 kg</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a futómű megfelel a TÜV előírásainak és rendelkezik engedéllyel</div>\\r\\n', 'Bilstein Renult Megane, 2.0 RS, 2.0TCe, 2008.11-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-renult-megane-2-0-rs-2-0tce-2008-11-tol-bilstein-b14-allithato-magassagu-futomu'),
(857, '', '<strong>Változtatható magasságú futómű Renault Megane 3-hoz</strong><br />Ez az alkatrész csak a 5 ajtós modellekhez illik<br />Kivétel: 2.0TCE 184KW, RS verzió<br />A termék TÜV engedéllyel rendelkezik<br />Az elülső ültetési tartomány 25-65mm között állítható<br />A hátsó ültetési tartomány 50-90mm között változtatható', 'V-Maxx Renault Megane MK3, 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI, csak 5 ajtós, kivéve 2.0TCE 184KW, RS, 2008.11-2015.10-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-megane-mk3-1-2tce-1-4tce-1-6-16v-2-0-cvt-2-0tce-162kw-1-5dci-1-6dci-1-9dci-2-0dci-csak-5-ajtos-kiveve-2-0tce-184kw-rs-2008-11-2015-10-ig-allithato-magassagu-futomu'),
(858, '', '<strong>Speciális Renault Megane 3 Cabrio V-Maxx futómű</strong><br />Kompatibilis az alábbi változatokkal: 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI<br />Kizárólag Cabrio modellekhez tervezve<br />Kivétel: 2.0TCE 184KW, RS verziók<br />A termék rendelkezik TÜV jóváhagyással!<br />Az elülső ülésmagasság állítási tartománya: 25-65mm<br />A hátsó ülésmagasság állítási tartománya: 50-90mm', 'V-Maxx Renault Megane MK3 Cabrio, 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI, kivéve 2.0TCE 184KW, RS, 2008.11-2015.10-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-megane-mk3-cabrio-1-2tce-1-4tce-1-6-16v-2-0-cvt-2-0tce-162kw-1-5dci-1-6dci-1-9dci-2-0dci-kiveve-2-0tce-184kw-rs-2008-11-2015-10-ig-allithato-magassagu-futomu'),
(859, '', '<strong>Rugalmas magasságú futómű a Renault Megane 3 Grandtour autóhoz V-Maxx technológiával</strong><br />Ezt a futóművet ajánljuk az alábbi típusokhoz: 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI<br />Csak a Grandtour típusú járművekhez alkalmas ez a futómű<br />Teljesíti a TÜV előírásait<br />Az elülső ültetés módosítható: 25-65 mm között<br />Hátsó ültetés módosítható: 50-90 mm között', 'V-Maxx Renault Megane MK3 Grandtour, 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI, 2008.11-2016.03-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-megane-mk3-grandtour-1-2tce-1-4tce-1-6-16v-2-0-cvt-2-0tce-162kw-1-5dci-1-6dci-1-9dci-2-0dci-2008-11-2016-03-ig-allithato-magassagu-futomu'),
(860, '', '<strong>Állítható magasságú futómű a Renault Megane 3 Coupéhoz</strong><br /><p>Az alábbi típusokkal kompatibilis: 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI</p><br /><p>Kizárólag Coupé modellekhez tervezve</p><br /><p>Nem támogatott modellek: 2.0TCE 184KW, RS</p><br /><p>A futómű rendelkezik TÜV engedéllyel</p><br /><p>Elülső ültetés mértéke: 25-65mm</p><br /><p>Hátsó ültetés mértéke: 50-90mm</p>', 'V-Maxx Renault Megane MK3 Coupé, 1.2TCE, 1.4TCE, 1.6 16V, 2.0 CVT, 2.0TCE 162KW, 1.5DCI, 1.6DCI, 1.9DCI, 2.0DCI, kivéve 2.0TCE 184KW, RS, 2008.11-2015.10-ig állítható magasságú futómű', '', '', '', 'v-maxx-renault-megane-mk3-coupe-1-2tce-1-4tce-1-6-16v-2-0-cvt-2-0tce-162kw-1-5dci-1-6dci-1-9dci-2-0dci-kiveve-2-0tce-184kw-rs-2008-11-2015-10-ig-allithato-magassagu-futomu'),
(861, '', '<p><strong>Állítható magasságú futómû a Renault Megane 4-hez Bilstein B14</strong></p>\n<ul>\n	<li>Ültetés mértéke elõl: 10-30mm</li>\n	<li>Ültetés mértéke hátul: 10-30mm</li>\n</ul>\n<p><br /> A BILSTEIN által kifejlesztett egycsöves rendszer az Upside-Down technológiát alkalmazza, mely versenysportrugókkal és állítható magassággal van ellátva. A futómű rugótányérja és kontra anyája alumíniumból készül, biztosítva ezzel a könnyű és erős konstrukciót. A B14 PSS modell lehetővé teszi a jármű magasságának csökkentését akár 50 mm-rel mind az első, mind a hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt minden körülmények között, így a vezető élvezheti az optimális vezetési élményt.</p>', 'Bilstein Renault Megane 4 Hatchback és Grandtour, 2015.11-től, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-renault-megane-4-hatchback-es-grandtour-2015-11-tol-bilstein-b14-allithato-magassagu-futomu'),
(862, '', '<strong>FK-Automotive állítható futómű a Renault Twingo számára</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Típuskód: C06</li>\\r\\n	<li>Évjárat: 1993 - 2007</li>\\r\\n	<li>Tengelyterhelés elöl: 700 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 595 kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\\r\\n	<li>A futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban talál.</li>\\r\\n	<li>1 ÉVES TELJESKÖRŰ GARANCIÁVAL!!!</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\\r\\n	<li>A csomag tartalmazza: 4 db lengéscsillapítót a hozzávaló rugókkal és az állításhoz szükséges 1 db kulccsal</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Renault Twingo, 1993-1997-ig állítható magasságú futómű', '', '', '', 'fk-automotive-renault-twingo-1993-1997-ig-allithato-magassagu-futomu'),
(863, '', '<div>\n    Ez a Renault Twingo C06 típusú autókhoz tervezett állítható magasságú moduláris AP-Fahrwerke futómű. Az alkatrész 1993.03-tól használható, elöl 700 kg, hátul 690 kg maximális tengelyterheléssel.<br>\n    Az Német nyelvű TÜV engedéllyel rendelkező futóműszett ültetési tartománya elöl 35-65 mm, hátul 35-60 mm között állítható, de testre szabható nagyobb intervallumban is.<br>\n    Az Ap-Fahrwerke futómű Made In Germany termék, 2 év garanciával. Termék cikkszáma: 11590004. Az ár egy szettre vonatkozik.\n</div>', 'AP made by KW Renault Twingo (Typ: C06), 1993.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-twingo-typ-c06-1993-03-tol-allithato-magassagu-futomu'),
(864, '', '<strong>FK-Automotive állítható futómű Renault Twingo autóhoz</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Típuskód: N</li>\\r\\n	<li>Évjárat: 2007-től</li>\\r\\n	<li>Tengelyterhelés elöl: 870 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 710 kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártási hely: NÉMETORSZÁG</li>\\r\\n	<li>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</li>\\r\\n	<li>1 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül versenyképes áron!!!</li>\\r\\n	<li>A csomag tartalma: 4 darab lengéscsillapító rugókkal és 1 darab állítókulccsal</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Renault Twingo (Typ: N), kivéve RS, 2007.03-tól állítható magasságú futómű', '', '', '', 'fk-automotive-renault-twingo-typ-n-kiveve-rs-2007-03-tol-allithato-magassagu-futomu'),
(865, '', '<p>Ez az állítható magasságú futómű AP-Fahrwerke gyártmányú, mely passzol a Renault Twingo RS típusú autókhoz. A futóműszett Német nyelvű TÜV engedéllyel rendelkezik, melyben meghatározott ültetés mértéke elöl 15-45 mm, hátul 15-35 mm között állítható. Fontos tudni, hogy minden esetben ennél nagyobb intervallumban is állítható a futómű, de a TÜV engedély csak a fenti beállításokra vonatkozik. A plussz ültetés lehetősége elöl és hátul +0 mm. A futómű Made In Ap-Fahrwerke Németországban készült, garanciális időtartama 2 év. A cikkszáma: GF90-030.</p>\n<p>Az ár egy szettre vonatkozik!</p>', 'AP made by KW Renault Twingo (Typ: N) RS, 2008.05-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-twingo-typ-n-rs-2008-05-tol-allithato-magassagu-futomu'),
(866, '', '<div>\n  <p>Ez a moduláris AP-Fahrwerke futómű állítható magassággal rendelkezik, mely tökéletesen illeszkedik a következő járműtípushoz:</p>\n  <ul>\n    <li>Renault Twingo Kivéve RS</li>\n    <li>Tipuskód: N</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 2007.03-tól</li>\n    <li>Tengelyterhelés elöl (kg): 850</li>\n    <li>Tengelyterhelés hátul (kg): 710</li>\n    <li>Egyéb kitételek: -</li>\n  </ul>\n</div>\n<div>\n  <ul>\n    <li>Ez a futóműrendszer rendelkezik német nyelvű TÜV engedéllyel.</li>\n    <li>Az engedélyben meghatározott ültetési tartomány elől: 25-55 mm, hátsó: 30-55 mm között állítható.<br />\n      (A futómű más beállítási lehetőségekkel is rendelkezik, azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n    <li>Extra ültetési lehetőség elől: +15 mm, hátsó: +0 mm</li>\n  </ul>\n</div>\n<div>\n  <ul>\n    <li>Gyártó: Ap-Fahrwerke, Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n</div>\n<p><strong>Cikkszám: GF90-025</strong></p>\n<p><br />\nAz ár egy szettre vonatkozik!</p>', 'AP made by KW Renault Twingo (Typ: N), kivéve RS, 2007.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-renault-twingo-typ-n-kiveve-rs-2007-03-tol-allithato-magassagu-futomu'),
(867, '', '<p>Az Audi A3 MTS-Technik által készített sport futóművei ideális választás lehetnek azok számára, akik kiemelten fontosnak tartják a minőséget és az ár-érték arányt. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóművei egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Fontos jellemzők:</u></p>\n<ul>\n    <li>A rugókat az Eibach gyártja</li>\n    <li>A magasság szabályozható általában 25 és 80 mm között</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém terhelés esetén is</li>\n    <li>Két rétegű bevonat a hosszú távú korrózióvédelemért</li>\n    <li>Rugó és lengéscsillapító tökéletes összhangja</li>\n    <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Altea (Typ: 5P), beleértve XL, 2004-től, (első tengely terhelés 1036-1170kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-altea-typ-5p-beleertve-xl-2004-tol-els-tengely-terheles-1036-1170kg-allithato-magassagu-futomu'),
(868, '', '<strong>Audi A3 MTS-Technik állítható magasságú sport futómű</strong></p>  <p>A fenti típusokhoz:</p>  <ul> 	<li><strong>Audi A3 (Típus: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Sportback (Típus: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Cabrio (Típus: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1035kg</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elöl: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Fontos! Használat előtt rövidített stabilizátor rudat javasolt beszerezni! (nem tartalmazza a készlet)</li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár! Fokozatmentesen állítható magasságának köszönhetően könnyedén igazítható az útviszonyokhoz! Az MTS-Technik futóműveinél tökéletes az egyensúly a rugók és a lengéscsillapítók között. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>gáztöltéses lengéscsillapítók</li> 	<li>kimagasló hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes harmónia a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p> ', 'MTS-Technik by Nord Performance Seat Altea (Typ: 5P), beleértve XL, 2004-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-altea-typ-5p-beleertve-xl-2004-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(869, '', '<p><strong>Volkswagen Passat B7 MTS-Technik Street Series állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p><u>Alkalmazható a következő típusokhoz:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Sedan:</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Variant:</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li>Első tengely terhelés: 1100-1180 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1230 kg alatt</li>\\r\\n	<li>Ültetés mértéke elöl: 35-70 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-60 mm</li>\\r\\n	<li><strong>A futómű beszereléséhez rövidített stabilizátor szett használata javasolt! A szett nem része a csomagnak. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az megfizethető ár! A fokozatmentesen állítható magasságnak köszönhetően könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően! Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>a termék rendelkezik TÜV engedéllyel!</strong></li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltéses lengéscsillapítók</li>\\r\\n	<li>kiemelkedő hatékonyság extrém igénybevételek esetén is</li>\\r\\n	<li>dupla bevonat a hosszan tartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>ideális egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Seat Altea (Typ: 5P) XL Freetrack, 2004-től, (első tengely terhelés 1115kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-altea-typ-5p-xl-freetrack-2004-tol-els-tengely-terheles-1115kg-alatt-allithato-magassagu-futomu'),
(870, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy milliméter pontossággal beállíthassa a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div>  <div>Egy alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot párhuzamosan összehangoljuk az optimális felépítés érdekében.</div>  <ul> 	<li>kiváló minőség megfizethető áron</li> 	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>kimagasló ár/érték arány</li> 	<li>német minőség</li> </ul>  ', 'AP made by KW Seat Altea (Typ: 5P), 2004.05-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-altea-typ-5p-2004-05-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(871, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal beállíthassák a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat a maximális ültetési magassággal kombináljuk.</div> <div>A járműmagasság egyedi beállítására alumínium rugótányér segítségével van lehetőség a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot párhuzamosan összehangolva optimális felépítést biztosítunk.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Seat Altea (Typ: 5P), 2004.05-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-altea-typ-5p-2004-05-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(872, '', '<div> <p>Ez az állítható magasságú futómű passzol az alábbi autótípusokhoz: Audi A3 Limousine, Sportback, Első kerék hajtás, Első lengéscsillapító átmérője: 55mm. Tipuskód: 8P. Évjárat: 2003.03-tól. Tengelyterhelés elöl: 1170 kg, hátul: 1005 kg. Kivéve: Quattro. Kivéve négykerék-meghajtású modellek. Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez. Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges!</p> </div> \n<div> <p>Ez a futóműszett német nyelvű TÜV engedéllyel rendelkezik. Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes). Plussz ültetés lehetőség elöl: +10 mm, hátul: +0 mm.</p> </div>\n<div> <p>Made In Ap-Fahrwerke Németország. Garancia erre a termékre: 2 év.</p> </div>\n<div> <p><strong>Cikkszáma: GF10-040</strong></p> <p><br /> Az ár 1 szettre vonatkozik!</p> </div>\n<div> Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek az egyéni ültetés beállítására. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</div>\n<div> Egy alumínium rugótányér segítségével lehetőség van a járműmagasságot a TÜV által engedélyezett tartományban egyénileg beállítani. A sportosság, a kényelem és a biztonság párhuzamos összehangolása egy optimális felépítést biztosít</div>\n<ul> <li>kiváló minőség megfizethető áron</li> <li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Seat Altea (Typ: 5P), 2004.05-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-altea-typ-5p-2004-05-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(873, '', '<p>Egy állítható magasságú futómű szett Vogtland gyártótól, mely kompatibilis a SEAT ALTEA modellel. Ez a futómű szett lehetővé teszi az ültetés mértékének szabályozását 20-50 mm között. Kifejezetten tervezve a Seat Altea, Typ 5P típusú autóhoz, ahol a lengéscsillapító ház átmérője 55 mm. Az elülső tengely maximális terhelése 1060 kg, míg a hátsó tengelyé 1150 kg.</p> <p>Ez a futómű szett nemcsak javítja az autó megjelenését, de emellett optimális vezetési élményt is nyújt. A speciális, nagy teljesítményű kétcsővű lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott kényelmet és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>Ez a termék rendelkezik TÜV minősítéssel és a gyártó cég, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek esetében szintezős vagy torziós futómű van felszerelve.</p> <p>Termékcsalád: Made in Germany!</p> <p>Cikkszám: 968235</p>', 'Vogtland Seat Altea (Typ: 5P), 2004.05-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-altea-typ-5p-2004-05-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(874, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a SEAT ALTEA típusú autókhoz. Ez a futómű szett lehetővé teszi az autó ültetésének széleskörű beállítását, így maximalizálva a vezetési élményt. A speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és dinamikát. Emellett kiváló minőségű korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek más típusú futóművet használnak.</p>\n<p>Ez a termék Made in Germany és a cikkszáma: 968237.</p>', 'Vogtland Seat Altea (Typ: 5P), 2004.05-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'vogtland-seat-altea-typ-5p-2004-05-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(875, '', '<p>A Vogtland által készített állítható magasságú futómű szett, melyet a SEAT ALTEA modellhez terveztek, 2004-től használható. Az ültetés mértéke 20-50 / 20-50 mm lehet, és a típusa Seat Altea, Typ 5P, a lengéscsillapító ház átmérője pedig 50 mm. Az elülső tengelyterhelés maximuma 1060 kg, míg a hátsóé 1150 kg.</p>\n\n<p>Ez a futómű szett nemcsak javítja az autó megjelenését, de maximális vezetési élményt is nyújt. Az ültetés mértékét az egyéni igények szerint lehet beállítani. A szett magas teljesítményű, kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme kiváló minőségű.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát nyújt az ültető rugókra és lengéscsillapítókra.</p>\n\n<p>A szett alapvetően tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyekhez szintező vagy torziós futóművet szereltek.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968234</p>', 'Vogtland Seat Altea (Typ: 5P), 2004.05-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-altea-typ-5p-2004-05-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(876, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a SEAT ALTEA típusú autókhoz, évjáratától függetlenül. Ennek a futómű szettnek az ültetés mértéke 20-50 mm között állítható, és a lengéscsillapító ház átmérője 50 mm. Az elülső tengely maximális terhelése több mint 1060 kg, míg a hátsó tengelyé 1150 kg.</p> <p>Ez a minőségi futómű szett nemcsak javítja az autó megjelenését, de optimális vezetési élményt is nyújt. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. Emellett kiváló korrózióvédelemmel rendelkeznek.</p> <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművet használnak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968236</p>', 'Vogtland Seat Altea (Typ: 5P), 2004.05-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'vogtland-seat-altea-typ-5p-2004-05-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(877, '', '<strong>Volkswagen Lupo MTS-Technik Street Series állítható magasságú sport futómű</strong></p>  <ul> 	<li>Volkswagen Lupo, 1.0 / 1.4 / 1.4 16V / 1.4FSI / 1.6GTI / 1.2TDI 3L / 1.4TDI / 1.7SDI</li> 	<li>Évjárat: 1998.09-től</li> 	<li>Ültetés mértéke elöl: 25-80mm</li> 	<li>Ültetés mértéke hátul: 25-60mm</li> 	<li>Első tengely terhelés: 820kg</li> 	<li>Hátsó tengely terhelés: 690kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/a6c10d33f2e662ee600acf617d83f1ff/27108_56916.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/129d43a903f116cf8905e7bba804ba28/27108_56915.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei kiváló választás azoknak, akik értékelik a minőséget és megfizethető árat! A magasság könnyedén beállítható az útviszonyoknak megfelelően, így az autó hasmagassága mindig optimális lesz. Az MTS-Technik futóművei ideális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p> ', 'MTS-Technik by Nord Performance Seat Arosa (Typ: 6H, 6HS), 1997.05-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-arosa-typ-6h-6hs-1997-05-tol-street-series-allithato-magassagu-futomu'),
(878, '', 'Az AP-Fahrwerke Állítható magasságú futóművet a Seat Arosa típusú autókhoz ajánljuk, melynek tipuskódja 6H, 6HS. Ez a futóműszett 1997.05-től gyártott autókhoz passzol, a tengelyterhelés elől 800 kg, míg hátul 690 kg. Fontos tudni, hogy ez a futómű Német TÜV engedéllyel rendelkezik, melyben meghatározott ültetési mértékek szerepelnek: elöl 30-70 mm, hátul 30-70 mm között állítható. Emellett extra ültetési lehetőség is van elöl +75 mm, hátul +0 mm. Ez a termék Made in Ap-Fahrwerke Németország, 2 év garanciával. A cikkszáma: GF81-007. Az ár 1 szettre vonatkozik.', 'AP made by KW Seat Arosa (Typ: 6H, 6HS), 1997.05-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-arosa-typ-6h-6hs-1997-05-tol-allithato-magassagu-futomu'),
(879, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a SEAT AROSA típusú autókhoz. Ez a futómű szett lehetővé teszi az ültetés mértékének széles skálájú beállítását, így mindenki megtalálhatja a számára legmegfelelőbb beállítást. A készlet tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat is, melyek kiegyensúlyozott komfortot és dinamikus vezetési élményt biztosítanak.</p>\n<p>Ezek az első osztályú lengéscsillapítók kiváló korrózióvédelmet nyújtanak, így hosszú távon is megőrzik minőségüket. A termék rendelkezik TÜV minősítéssel, és a gyártó 2 év garanciát vállal az ültető rugók és lengéscsillapítók cseréjére.</p>\n<p>A futómű szett tartalmazza az 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autóknál, melyek szintezővel vagy torziós futóművel vannak felszerelve. Minden termék \"Made in Germany\" minőséget képvisel.</p>\n<p>Cikkszám: 968351</p>', 'Vogtland Seat Arosa, 1997.05-től állítható magasságú futómű', '', '', '', 'vogtland-seat-arosa-1997-05-tol-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(880, '', '<p>Az MTS-Technik által gyártott állítható magasságú sport futóművek kiváló választás azoknak, akik számára fontos a minőség és az ár. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei optimalizált egyensúlyt teremtenek a rugók és lengéscsillapítók között.</p>\n\n<p><u>Kompatibilis típusok:</u></p>\n\n<ul>\n	<li>Volkswagen Tiguan (Typ: AD1, AX1), 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1100kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Rugó erősség (első, fő rugó): 40 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>A termék jelenleg nem rendelkezik TÜV engedéllyel, az engedélyezés folyamatban van.</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelemért</li>\n	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel autómodifikációt</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Ateca, 1.4TSi 4Drive, 1.5TSi 4Drive, 2.0TSi 4Drive, 2.0TDi 4Drive, 2018.09-től, (első tengely terhelés 1050kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ateca-1-4tsi-4drive-1-5tsi-4drive-2-0tsi-4drive-2-0tdi-4drive-2018-09-tol-els-tengely-terheles-1050kg-alatt-street-series-allithato-magassagu-futomu'),
(881, '', '<strong>Volkswagen Tiguan MTS-Technik Street állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>A MTS-Technik által készített állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz, és beállíthatja az autó hasmagasságát. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Az alábbi típusokhoz alkalmas:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1), </strong>1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\\r\\n	<li>Elülső ültetés: 35-55mm</li>\\r\\n	<li>Hátsó ültetés: 30-55mm</li>\\r\\n	<li>Elülső tengely terhelés: 1101-1240kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1400kg</li>\\r\\n	<li>Rugó erősség (elülső): 45 N/mm</li>\\r\\n	<li>Rugó erősség (hátsó): 60 N/mm</li>\\r\\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyezés folyamatban van</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>A magasság általában 25 és 80 mm között állítható</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\\r\\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében</li>\\r\\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\\r\\n	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><u><strong>Termék jellemzői:</strong></u></p>\\r\\n\\r\\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\\r\\n\\r\\n<p><em>A weboldalon található szöveges és képi anyagok engedély nélküli másolása tilos!</em></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p> </p>\\r\\n', 'MTS-Technik by Nord Performance Seat Ateca, 1.4TSi 4Drive, 1.5TSi 4Drive, 2.0TSi 4Drive, 2.0TDi 4Drive, 2016.04-től, (első tengely terhelés 1051-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ateca-1-4tsi-4drive-1-5tsi-4drive-2-0tsi-4drive-2-0tdi-4drive-2016-04-tol-els-tengely-terheles-1051-1240kg-street-series-allithato-magassagu-futomu'),
(882, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akiknek fontos a kiváló minőség és az elérhető ár. A futómű fokozatmentesen állítható magassága könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben optimális összhang van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz ajánlott:</u></p>\n\n<ul>\n	<li>Volkswagen Tiguan (Typ: AD1, AX1), 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1060kg</li>\n	<li>Hátsó tengely terhelés: 1390kg</li>\n	<li>Rugó erősség (első, fő rugó): 40 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 55 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van</li>\n</ul>\n\n<p><u>Termékinformációk:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Ateca, 1.0TSi, 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi, 2016.04-től, (első tengely terhelés 1020kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ateca-1-0tsi-1-4tsi-1-5tsi-1-6tdi-2-0tdi-2016-04-tol-els-tengely-terheles-1020kg-alatt-street-series-allithato-magassagu-futomu'),
(883, '', '<strong>Volkswagen Tiguan MTS-Technik Street állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik fontosnak tartják a kiváló minőséget és az megfizethető árat! A magasság fokozatmentesen szabályozható, így könnyedén beállítható az autó talajtól való magassága az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben az optimális egyensúlyt a rugók és a lengéscsillapítók között garantálják.</p>\\r\\n\\r\\n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1),</strong> 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\\r\\n	<li>Elülső ültetés: 35-55mm</li>\\r\\n	<li>Hátsó ültetés: 30-55mm</li>\\r\\n	<li>Elülső tengely terhelés: 1061-1190kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1390kg</li>\\r\\n	<li>Rugó erőssége (elülső fő rugó): 45 N/mm</li>\\r\\n	<li>Rugó erőssége (hátsó fő rugó): 55 N/mm</li>\\r\\n	<li>Nem rendelkezik TÜV engedéllyel! Engedélyezés folyamatban!</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>A magasság általában 25 és 80 mm között állítható</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém körülmények között is</li>\\r\\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><u><strong>Termék jellemzők:</strong></u></p>\\r\\n\\r\\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\\r\\n\\r\\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p> </p>\\r\\n', 'MTS-Technik by Nord Performance Seat Ateca, 1.0TSi, 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi, 2016.04-től, (első tengely terhelés 1021-1190kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ateca-1-0tsi-1-4tsi-1-5tsi-1-6tdi-2-0tdi-2016-04-tol-els-tengely-terheles-1021-1190kg-street-series-allithato-magassagu-futomu'),
(884, '', '<p>Egy állítható magasságú sport futómű, mely ideális választás Seat Cordoba Limousine és Variant modellekhez. A futómű rugóit az Eibach gyártja, és a magasság fokozatmentesen állítható 25 és 80 mm között. Emellett gáztöltésű lengéscsillapítókkal rendelkezik, melyek extrém terhelés mellett is kiemelkedő hatékonyságot biztosítanak. A korrózió ellen két rétegű bevonattal rendelkezik, valamint teljes összhangban van a rugók és a lengéscsillapítók között. A futómű egyszerűen telepíthető anélkül, hogy módosításokat kellene végezni az autó felfüggesztésén.</p>', 'MTS-Technik by Nord Performance Seat Cordoba (Typ: 6K/C), beleértve Kombi, 1993-1999-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-cordoba-typ-6kc-beleertve-kombi-1993-1999-ig-street-series-allithato-magassagu-futomu'),
(885, '', '<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. A maximális vezetési élmény érdekében széles ültetési tartomány áll rendelkezésre.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Cordoba (Typ: 6K/C), beleértve Kombi, 1993-1999-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-cordoba-typ-6kc-beleertve-kombi-1993-1999-ig-sport-series-allithato-magassagu-futomu'),
(886, '', '<p>A <strong>Volkswagen Polo 6N MTS-Technik Comfort Series állítható magasságú sport futómű</strong> ideális választás azoknak, akik szeretnének sportosabb külsőt és növelni szeretnék az utazási kényelmet is. Az MTS-Technik Comfort futóművek lehetővé teszik a magasság fokozatmentes állítását, így könnyedén alkalmazkodhat az útviszonyokhoz. A futóművekben az Eibach rugók és MTS-Technik lengéscsillapítók optimális egyensúlyban vannak.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>A Comfort Series létrehozása során a hangsúlyt a magas komfort helyezték</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Cordoba (Typ: 6K/C), beleértve Kombi, 1993-1999-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-cordoba-typ-6kc-beleertve-kombi-1993-1999-ig-comfort-series-allithato-magassagu-futomu'),
(887, '', '<div>Ez az AP-Fahrwerke Állítható magasságú futómű tökéletesen illeszkedik a következő autótípushoz:</div>\n<ul>\n    <li>Autó: Seat Cordoba</li>\n    <li>Tipuskód: 6K/C</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 1993.11 - 1999.09</li>\n    <li>Tengelyterhelés elöl (kg): 900</li>\n    <li>Tengelyterhelés hátul (kg): 810</li>\n    <li>Ez a futómű Német nyelvű TÜV engedéllyel büszkélkedhet!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br />(Az állítási intervallum ennél nagyobb is lehet, de a TÜV engedély kizárólag ezen beállításokra vonatkozik.)</li>\n    <li>Plusz ültetési lehetőség elöl: +55 mm, hátul: +80 mm</li>\n    <li>Készült az AP-Fahrwerke németországi gyárában</li>\n    <li>2 év garancia ezen termékre</li>\n</ul>\n<p><strong>Cikkszám: GF81-003</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Seat Cordoba (Typ: 6K/C), 1993.08-1999.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-cordoba-typ-6kc-1993-08-1999-09-ig-allithato-magassagu-futomu'),
(888, '', '<p>A Vogtland állítható magasságú futómű szett számára, melyet a SEAT CORDOBA típusú autókhoz terveztek, az alábbi információkat találhatod:</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1993-1999</li>\n	<li><strong>Ültetés mértéke:</strong> 20 - 70 / 50 - 70 mm</li>\n	<li><strong>Típus</strong>: Seat Cordoba, Typ 6K/C</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 870 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 760 kg</li>\n</ul>\n<p>Az autó megjelenésén javítva, ez a futómű szett optimális vezetési élményt nyújt. Az ültetési magasság szabadon állítható a megfelelő értékekre az egyéni igények szerint. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamizmust biztosítanak. A lengéscsillapítók első osztályú korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968528</p>', 'Vogtland Seat Cordoba (Typ: 6K/C), 1993.08-1999.09-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-cordoba-typ-6kc-1993-08-1999-09-ig-allithato-magassagu-futomu'),
(889, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az előnyös ár. A magasság folyamatosan szabályozható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém igénybevételek esetén is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Seat Cordoba (Typ: 6K2), 1999.07-2002-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-cordoba-typ-6k2-1999-07-2002-ig-allithato-magassagu-futomu'),
(890, '', '<div> <p>Ez a magasságállítható AP-Fahrwerke futómű modell az alábbi autótípushoz illeszkedik:</p>  <ul> 	<li>Seat Ibiza</li> 	<li>Tipuskód: 6K</li> 	<li>Évjárat: 1999.10 - 2002.03</li> 	<li>Tengelyterhelés elöl (kg): 900</li> 	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br /> 	(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li> 	<li>Extra ültetési lehetőség elöl: +85 mm, hátul: +80 mm</li> 	<li>Gyártva: Ap-Fahrwerke, Németország</li> 	<li>2 év garancia a termékre</li> </ul>  <p><strong>Cikkszám: GF81-012</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Seat Cordoba (Typ: 6K/C), 1999.10-2002-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-cordoba-typ-6kc-1999-10-2002-ig-allithato-magassagu-futomu'),
(891, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: SEAT CORDOBA</p>\n<ul>\n    <li><strong>Évjárat</strong>: 1999-2002</li>\n    <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>\n    <li><strong>Típus</strong>: Seat Cordoba, Typ 6K2/C, 2000-as (Facelift) változattól</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 900 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 810 kg</li>\n</ul>\n<p>Az autó külső megjelenésén javít, miközben optimális vezetési élményt nyújt. Az ültetés mértékét az egyéni igényeknek megfelelően szabályozhatja. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók rendkívül ellenállóak a korróziónak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968352</p>', 'Vogtland Seat Cordoba (Typ: 6K2), 1999.10-2002-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-cordoba-typ-6k2-1999-10-2002-ig-allithato-magassagu-futomu'),
(892, '', '<p>Egy állítható magasságú sport futómű a Seat Ibiza Jom Blueline számára.</p>\n<p>Ez a futómű típuskódja: 6L, és 2002-től elérhető.</p>\n<p>A magasságállító a hátsó tengelynél a rugó alatt található.</p>\n<p>Fontos: Egyes modelleknél a beszereléshez rövidített stabilizátor rúdra lehet szükség, mely nem része ennek a szettnek!</p>\n<p>A futómű tengelyterhelése elöl: 960 kg, hátul: 840 kg.</p>\n<p>Made in Germany - Azaz Németországban gyártott termék.</p>\n<p>A futómű rendelkezik német TÜV engedéllyel, melyet a csomag tartalmaz.</p>\n<p>2 év teljeskörű garanciával ellátva!</p>\n<p>Kiváló minőségű termék hihetetlenül jó áron!</p>\n<p>A szett tartalmazza: 4db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1db állítókulcsot.</p>', 'Jom Bochum Seat Cordoba (Typ: 6L), 2002-2008-ig, Blueline állítható magasságú futómű', '', '', '', 'jom-bochum-seat-cordoba-typ-6l-2002-2008-ig-blueline-allithato-magassagu-futomu'),
(893, '', '<strong>MTS-Technik Sport állítható magasságú sport futómű</strong></p> <p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futóművei</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz, biztosítva a maximális vezetési élményt és széles ültetési tartományt. Az <strong>MTS-Technik Sport futóművek</strong> optimalizált egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között.</p> <p><u>Az alábbi típusokhoz kompatibilis:</u></p> <ul> <li><strong>Skoda Fabia:</strong> 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> <li>Elülső ültetési mérték: 50-80mm</li> <li>Hátsó ültetési mérték: 50-90mm</li> <li>Elülső tengely terhelés: 960kg</li> <li>Hátsó tengely terhelés: 840kg</li> </ul> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> <li>Speciális <strong>Eibach rugók</strong> sportos teljesítményhez</li> <li>A <strong>Sport sorozat</strong> célja a széles ültetési tartomány és a fokozott vezetési élmény</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Magas hatékonyság extrém terhelés mellett is</li> <li>Két rétegű bevonat a hosszútávú korrózióvédelem érdekében</li> <li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li> <li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésén</li> </ul> <p><u><strong>Termék jellemzők:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Seat Cordoba (Typ: 6L), 2002-2008-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-cordoba-typ-6l-2002-2008-ig-sport-series-allithato-magassagu-futomu'),
(894, '', '<strong>MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek kiváló választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek fokozatmentesen állítható magassággal rendelkeznek, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyával rendelkeznek.</p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Skoda Fabia, </strong>1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> 	<li>Elülső ültetés mértéke: 15-60mm</li> 	<li>Hátsó ültetés mértéke: 15-60mm</li> 	<li>Elülső tengely terhelése: 960kg</li> 	<li>Hátsó tengely terhelése: 840kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>A magasság széles skálán állítható, általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li> 	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Seat Cordoba (Typ: 6L), 2002-2008-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-cordoba-typ-6l-2002-2008-ig-street-series-allithato-magassagu-futomu'),
(895, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a SEAT CORDOBA típusú autókhoz, kifejezetten az 2002-től gyártott modellekhez. Ennek a futómű szettnek az ültetés mértéke 35-60/35-60 mm, és a maximális tengelyterhelés elöl 955 kg, míg hátul 840 kg lehet. </p>\n<p>Ez a minőségi futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanapság vezetési élményt is nyújt. A beállítható ültetésnek köszönhetően testreszabhatja az autó magasságát az ön igényei szerint. A szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek a kiegyensúlyozott komfort és a fokozott dinamika érdekében lettek kialakítva. Ezek a lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező vagy torziós futóművet kell felszerelni.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968353</p>', 'Vogtland Seat Cordoba (Typ: 6L), 2002.10-től állítható magasságú futómű', '', '', '', 'vogtland-seat-cordoba-typ-6l-2002-10-tol-allithato-magassagu-futomu'),
(896, '', '<p>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák az általuk kívánt üléspozíciót. Az optimális vezetési élményt és sportos irányíthatóságot maximális ülésmagassággal kombinálva biztosítjuk.</p>\n\n<p>Egy alumínium rugótányér segítségével lehetőség van a jármű magasságának egyéni beállítására a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</p>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>kivételes ár/érték arány</li>\n	<li>német minőség</li>\n</ul>\n\n<p>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</p>', 'AP made by KW Seat Cordoba (Typ: 6L), 2002.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-cordoba-typ-6l-2002-10-tol-allithato-magassagu-futomu'),
(897, '', 'Az MTS-Technik állítható magasságú sport futóművei ideális választást kínálnak azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik állítható futóművei kiváló egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém terhelés mellett is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Exeo ST, 2009.04-2013-ig, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-exeo-st-2009-04-2013-ig-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(898, '', 'Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A magasság fokozatmentesen szabályozható, így könnyedén igazítható az útviszonyokhoz az autó hasmagassága. Az MTS-Technik futóművei kimagasló egyensúlyt teremtenek a rugók és a lengéscsillapítók között.\n\n<u>Termékjellemzők:</u>\n- Az állítható magasságú futóművek rugóit az Eibach gyártja.\n- A magasság általában 25 és 80 mm között szabadon állítható.\n- Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém igénybevétel esetén is.\n- Két rétegű bevonat védi a futóművet a hosszú távú korróziótól (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).\n- A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással.\n- A készlet plug & play, így nem szükséges módosítás az autó felfüggesztésében.', 'MTS-Technik by Nord Performance Seat Exeo ST, 2009.04-2013-ig, (első tengely terhelés 1081-1220kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-exeo-st-2009-04-2013-ig-els-tengely-terheles-1081-1220kg-allithato-magassagu-futomu'),
(899, '', 'Az AP-Fahrwerke Állítható magasságú futómű alkalmas a következő autótípusokhoz: Seat Exeo Limousine, Kombi, Tipuskód: 3R, ST, Típus variáció, Évjárat: 2009.03-tól, Tengelyterhelés elöl (kg): 1135, Tengelyterhelés hátul (kg): 1135, Egyéb kitételek: -. \n\nEz a futóműszett rendelkezik Német nyelvű TÜV engedéllyel. Az engedélyben meghatározott ültetés mértéke elöl: 20-60 mm, hátul: 30-60 mm között állítható (Más beállítások is lehetségesek, de a TÜV engedély csak a fent említettekkel érvényes). Plussz ültetés lehetősége elöl: +60 mm, hátul: +0 mm. \n\nGyártva Ap-Fahrwerke Németországban, 2 éves garancia a termékre. \n\nCikkszáma: GF81-023. Az ár egy szettre vonatkozik!', 'AP made by KW Seat Exeo (Typ: 3R), 2009.03-tól, (első tengely terhelés 1135kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-exeo-typ-3r-2009-03-tol-els-tengely-terheles-1135kg-alatt-allithato-magassagu-futomu'),
(900, '', '<div><strong>Audi A4 (Typ: B6, B7) Bilstein B14 állítható magasságú sport futómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az autó üléseinek magassága módosítható, az első tengelyen 30-60 mm-el, míg a hátsó tengelyen 20-50 mm-el.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely terhelhetősége 1250 kg, míg a hátsó tengelyé 1170 kg.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel.</div>\\r\\n', 'Bilstein Seat Exeo, 1.6, 1.8 T, 1.8 TSI, 2.0 TDI, 2.0 TFSI, 2009.02-től, Bilstein B14 állítható magasságú sport futómű állítható magasságú futómű', '', '', '', 'bilstein-seat-exeo-1-6-1-8-t-1-8-tsi-2-0-tdi-2-0-tfsi-2009-02-tol-bilstein-b14-allithato-magassagu-sport-futomu-allithato-magassagu-futomu'),
(901, '', '<p>Egyedi JOM BLUE LINE futómű a Seat Ibiza járművekhez</p><br />\\r\\n\\r\\n<p>Típuskód: 6J<br />\\r\\nGyártási év: 2008-tól<br />\\r\\nAz állítható magasság a hátsó tengelyen a rugó alatt található.<br />\\r\\nFONTOS! Az egyes modellekhez rövidített stabilizátor rúd (kutyacsont) szükséges a futómű telepítéséhez, ez a készlet nem tartalmazza!<br />\\r\\nElülső tengely terhelése: 960 kg<br />\\r\\nHátsó tengely terhelése: 840 kg<br />\\r\\nKészült NÉMETORSZÁGBAN<br />\\r\\nEz a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalál.<br />\\r\\n2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!<br />\\r\\nMagas minőség, kiváló ár-érték arány!!!<br />\\r\\nA szett tartalma: 4 lengéscsillapító a hozzá tartozó rugókkal és 1 állítókulccsal</p>\\r\\n', 'Jom Bochum Seat Ibiza (Typ: 6J), 2008.06-tól, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-ibiza-typ-6j-2008-06-tol-blue-line-allithato-magassagu-futomu'),
(902, '', '<strong>Állítható futómű a Seat Ibiza számára</strong><br /><p>A Seat Ibiza (Typ: 6J) modellekre tervezett állítható futómű lehetővé teszi az autó futóművének testreszabását. Az állítható futóművet 2008.03-tól 2018-ig gyártott Ibiza modellekhez ajánljuk.</p><br /><p>A futómű kompatibilis a következő motorváltozatokkal: 1.0, 1.0TSI, 1.2, 1.2TSI, 1.4, 1.4TSI, 1.6, 1.8TSI, 1.4 TDi, 1.6TDi, 1.9TDi, 2.0 TDi kivéve a 4-Motion modellt.</p><br /><p>A futómű beépítéséhez rövidített stabilizátorrudat kell beszerezni (az ár nem tartalmazza).</p><br /><p>Az állítható futómű elülső ültetésének mértéke 35-70mm, míg a hátsó ültetésé 30-50mm.</p><br /><p>A termékre 24 hónap garancia vonatkozik, valamint rendelkezik TÜV engedéllyel is.</p><br /><p>Szerelési útmutató: <a href=\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\">https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf</a></p><br /><p>TÜV engedély: <a href=\"https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf\">https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf</a></p>', 'V-Maxx Seat Ibiza (Typ: 6J), kivéve 4-Motion, 2008.03-2018-ig állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-typ-6j-kiveve-4-motion-2008-03-2018-ig-allithato-magassagu-futomu'),
(903, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiváló egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltéses lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém körülmények között is</li> <li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6J), beleértve Kombi, Sport Coupé, 2008.03-tól, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6j-beleertve-kombi-sport-coupe-2008-03-tol-street-series-allithato-magassagu-futomu'),
(904, '', '<strong>Volkswagen Polo 6R MTS-Technik Comfort Series állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Volkswagen Polo 6R</strong> különböző motorváltozatokkal és évjáratokkal</li> 	<li>Évjárat: 2009.06-tól</li> 	<li>Ültetés mértéke elöl: 15-60mm</li> 	<li>Ültetés mértéke hátul: 15-60mm</li> </ul>  <p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választást nyújtanak azoknak, akik szeretnék kombinálni a sportos megjelenést és az utazási kényelmet. A magasság könnyedén állítható a útviszonyoknak megfelelően, így biztosítva a megfelelő hasmagasságot. Az MTS-Technik Comfort futóműveiben az Eibach rugók és az MTS-Technik lengéscsillapítók optimális egyensúlyban működnek.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók a maximális kényelemért</li> 	<li>A Comfort Series célja a magas kényelem, nem az extrém ültetés</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>Plug & play készlet, nem igényel autómodosítást</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></p>  ', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6J), beleértve Kombi, Sport Coupé, 2008.03-tól, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6j-beleertve-kombi-sport-coupe-2008-03-tol-comfort-series-allithato-magassagu-futomu'),
(905, '', '<strong>Állítható magasságú és keménységű futómű a Seat Ibiza járműhöz</strong><br /><ul><li>Típus: Seat Ibiza (Typ: 6J)</li><li>Évjárat: 2018.03-2018-ig</li><li>Motor: 1.0 / 1.0TSI / 1.2 / 1.2TSI / 1.4 / 1.4TSI / 1.6 / 1.8TSI / 1.4 TDi / 1.6TDi / 1.9TDi / 2.0 TDi</li><li>Kivéve 4-Motion</li><li>20 fokozatban állítható keménység</li><li>A beépítéshez rövidített stabilizátorrúd szükséges, az ár nem tartalmazza</li><li>Ültetés mértéke elöl: 35-70mm</li><li>Ültetés mértéke hátul: 30-50mm</li><li>24 hónapos garancia</li><li>A futómű TÜV engedéllyel rendelkezik</li></ul><br /><p>Szerelési útmutató: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf</a></p><br /><p>TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf\\\">https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf</a></p>', 'V-Maxx Seat Ibiza (Typ: 6J), kivéve 4-Motion, 2008.03-2018-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-typ-6j-kiveve-4-motion-2008-03-2018-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(906, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára tervezett, akik szeretnék precízen beállítani az ültetést. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözése a maximális ültetés élményével.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetőség van az autó magasságának egyéni beállítására a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság összehangolása optimális felhasználói élményt nyújt.</span></div> <ul>     <li><span>Kiemelkedő minőség megfizethető áron</span></li>     <li><span>Egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár/érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Seat Ibiza (Typ: 6J), 2008.06-tól, (első tengely terhelés 861-960kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-ibiza-typ-6j-2008-06-tol-els-tengely-terheles-861-960kg-allithato-magassagu-futomu'),
(907, '', '<div>\n<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetőknek, hogy milliméterre precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk, összekapcsolva a maximális ültetéssel.</div>\n\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság összehangolása optimális felépítést biztosít.</div>\n\n<ul>\n    <li>kiváló minőség elérhető áron</li>\n    <li>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</li>\n    <li>kiváló minőségű alkatrészek és TÜV tanúsítvány garantálja a megbízhatóságot</li>\n    <li>kiemelkedő ár-érték arány</li>\n    <li>német minőség</li>\n</ul>\n</div>', 'AP made by KW Seat Ibiza (Typ: 6J), 2008.06-tól, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-ibiza-typ-6j-2008-06-tol-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(908, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: SEAT IBIZA 6J KOMBI</span></div>  <ul> 	<li><strong>Évjárat</strong>: 2010.05-től</li> 	<li><strong>Ültetés mértéke</strong>: 15 - 50 / 30 - 55 mm</li> 	<li><strong>Típus</strong>: Seat Ibiza ST, Typ 6J, Kombi</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 860 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 820 kg</li> </ul>  <p>Az autó megjelenését felfrissítő Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az egyedi elképzeléseknek megfelelően szabályozható ültetés mértéke lehetővé teszi a testreszabott beállításokat. A futómű tartalmaz kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, amelyek kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel ellátottak.</p>  <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra, akik több mint 100 éves tapasztalattal rendelkeznek a rugógyártás területén.</p>  <p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más futóművet használnak.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968134</p>', 'Vogtland Seat Ibiza (Typ: 6J) Kombi, 2010.05-től, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6j-kombi-2010-05-tol-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(909, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: SEAT IBIZA</p>  <ul> 	<li><strong>Évjárat</strong>: 2008.06-tól</li> 	<li><strong>Ültetés mértéke:</strong> 30 - 60 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Seat Ibiza, Typ 6J</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 820 kg</li> </ul>  <p>Az autó megjelenésén javító Vogtland állítható magasságú futómû szett új szintet teremt a vezetési élményben. Az egyedi ültetés szabadon állítható a kívánt szintre, miközben a kényelmet és dinamizmust az alacsony nyomású gázrendszerű kétcsöves lengéscsillapítók biztosítják. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, garantálva a stabil és komfortos vezetést.</p>  <p>A termék büszkén rendelkezik TÜV minősítéssel. A gyártó, aki több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A csomag alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve az autótípusokat, amelyekhez szintező- vagy torziós futóművet használnak.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968077</p> ', 'Vogtland Seat Ibiza (Typ: 6J), 2008.06-tól, (első tengely terhelés 861-960kg) állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6j-2008-06-tol-els-tengely-terheles-861-960kg-allithato-magassagu-futomu'),
(910, '', '<p><strong>Vogtland</strong><span> által kifejlesztett állítható magasságú futómű szett a SEAT IBIZA modellhez.</span></p>  \n<ul> 	\n	<li><strong>Évjárat</strong>: 2008.06-tól</li> 	\n	<li><strong>Ültetés mértéke:</strong> 30 - 60 / 25 - 50 mm</li> 	\n	<li><strong>Típus</strong>: Seat Ibiza, Typ 6J</li> 	\n	<li><strong>Max. tengelyterhelés elöl</strong>: 860 kg</li> 	\n	<li><strong>Max. tengelyterhelés hátul</strong>: 820 kg</li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett a futómű szett optimális vezetési élményt nyújt. A beállítások lehetőséget adnak az ültetés egyénre szabott módosítására. A kiváló minőségű futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  \n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>Made in Germany!</p>  \n<p>Cikkszám: 968076</p>  ', 'Vogtland Seat Ibiza (Typ: 6J), 2008.06-tól, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6j-2008-06-tol-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(911, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SEAT IBIZA 6J KOMBI</span></div>  <ul> 	<li><strong>Évjárat</strong>: 2010.05-tõl</li> 	<li><strong>Ültetés mértéke</strong>: 15 - 50 / 30 - 55 mm</li> 	<li><strong>Típus</strong>: Seat Ibiza ST, Typ 6J, Kombi</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 820 kg</li> </ul>  <p>Az autó megjelenése és vezetési élménye is fokozható a Vogtland állítható magasságú futómű szett segítségével. Az ültetés mértéke szabadon állítható a felhasználó elképzeléseinek megfelelően. Ez a speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és dinamikus vezetési élményt biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek első osztályú minőségben.</p>  <p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra, akik több mint 100 éves tapasztalattal rendelkeznek a rugógyártás területén.</p>  <p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968136</p> ', 'Vogtland Seat Ibiza (Typ: 6J) Kombi, 2010.05-től, (első tengely terhelés 861-960kg) állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6j-kombi-2010-05-tol-els-tengely-terheles-861-960kg-allithato-magassagu-futomu'),
(912, '', '<strong>Volkswagen Polo 6N JOM BLUE LINE állítható futómű</strong></p>\\r\\n\\r\\n<p>Ez a futómű termék tökéletes választás Volkswagen Polo 6N típusú autókhoz, gyártási éve 1994 szeptemberétől 1999 szeptemberéig.</p>\\r\\n\\r\\n<p>Az elülső tengelyterhelés 865 kg, míg a hátsó tengelyterhelés 820 kg.</p>\\r\\n\\r\\n<p>A futómű MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>A termék 2 év teljeskörű garanciával érkezik, így biztos lehet benne, hogy hosszú távon is kiváló teljesítményt nyújt.</p>\\r\\n\\r\\n<p>A futómű ültetésének mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével, így könnyedén személyre szabhatja az autó magasságát.</p>\\r\\n\\r\\n<p>Az ajánlat részeként 4 db lengéscsillapító, hozzájuk tartozó rugók és az állításhoz szükséges 1 db kulcs található a szettben.</p>', 'Jom Bochum Seat Ibiza (Typ: 6K), 1993-1999-ig állítható magasságú futómű', '', '', '', 'jom-bochum-seat-ibiza-typ-6k-1993-1999-ig-allithato-magassagu-futomu'),
(913, '', '<div>\\nAz állítható magasságú futómű lehetőséget biztosít a Seat Ibiza V-Maxx modelljéhez.\\n</div>', 'V-Maxx Seat Ibiza (Typ: 6K), 1993-1999-ig állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-typ-6k-1993-1999-ig-allithato-magassagu-futomu'),
(914, '', '<strong>Volkswagen Polo 6N MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>  \n<ul>  \n	<li>Volkswagen Polo 6N modellek: 1.0 / 1.3 / 1.4 / 1.4 16V / 1.6 / 1.6 16V GTI / 1.7SDI / 1.9D / 1.9SDI</li>  \n	<li>Volkswagen Polo Classic modellek: 1.4 / 1.4 16V / 1.6 / 1.8 / 1.7SDI / 1.9SDI / 1.9TDI</li>  \n	<li>Volkswagen Polo 6N Variant modellek: 1.4 / 1.4 16V / 1.6 / 1.8 / 1.7SDI / 1.9SDI / 1.9TDI</li>  \n	<li>Elülső ültetés mértéke: 20-90mm</li>  \n	<li>Hátsó ültetés mértéke: 20-80mm</li>  \n	<li>Elülső tengely terhelés: 900kg</li>  \n	<li>Hátsó tengely terhelés: 810kg</li>  \n	<li>Tüv engedélyezése folyamatban</li>  \n</ul>  \n<p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik nem szeretnének kompromisszumot kötni. A futómű magassága fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva a maximális vezetési élményt és széles ültetési tartományt.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja.</li>  \n	<li>Speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében.</li>  \n	<li>A <strong>Sport Series</strong> létrehozásánál a cél a szélesebb ültetési tartomány és a fokozott vezetési élmény volt.</li>  \n	<li>Gáztöltéses lengéscsillapítók.</li>  \n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>  \n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>  \n	<li>Tökéletes összhang rugó és lengéscsillapító között.</li>  \n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>  \n</ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6K), 1993.03-1999.07-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6k-1993-03-1999-07-ig-sport-series-allithato-magassagu-futomu'),
(915, '', '<strong>Állítható magasságú sport futómű a Seat Ibiza 6K MTS-Technik Street Series modellekhez</strong><br /><ul><li>Kiváló minőségű futómű rugók és lengéscsillapítók egyensúlyban</li><li>Fokozatmentesen állítható magasság az útviszonyokhoz való könnyű alkalmazkodás érdekében</li><li>Elülső tengely terhelése: 900kg, hátsó tengely terhelése: 810kg</li><li>Tüv engedélyezés folyamatban</li></ul><br /><p>A MTS-Technik által gyártott állítható magasságú sport futóművek ideális választások azoknak, akik számára fontos a kiváló minőség és az előnyös ár. A futóművek rugalmasak és hatékonyak, még extrém terhelés esetén is. Az állítható magasságú futóművek rugóit az Eibach gyártja, melyeket általában 25 és 80 mm között lehet szabadon állítani. A futóművek bevonata két rétegű, hosszantartó védelmet nyújt a korrózió ellen.</p><br /><p><u>Termékjellemzők:</u></p><br /><ul><li>Gáztöltésű lengéscsillapítók az optimális teljesítményért</li><li>Rugalmas rugó és lengéscsillapító együttműködés</li><li>Plug & Play készlet autófelfüggesztés módosítás nélkül</li></ul><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" style=\\\"height:314px; width:400px\\\" /></p>', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6K), 1993.03-1999.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6k-1993-03-1999-07-ig-street-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(916, '', '<p><strong>MTS-Technik Comfort Series állítható magasságú sport futómű</strong></p>  \n<ul>  \n	<li>Volkswagen Polo 6N, 1.0 / 1.3 / 1.4 / 1.4 16V / 1.6 / 1.6 16V GTI / 1.7SDI / 1.9D / 1.9SDI</li>  \n	<li>Volkswagen Polo Classic, 1.4 / 1.4 16V / 1.6 / 1.8 / 1.7SDI / 1.9SDI / 1.9TDI</li>  \n	<li>Volkswagen Polo 6N Variant, 1.4 / 1.4 16V / 1.6 / 1.8 / 1.7SDI / 1.9SDI / 1.9TDI</li>  \n	<li>Ültetés mértéke elõl: 20-90mm</li>  \n	<li>Ültetés mértéke hátul: 20-80mm</li>  \n	<li>Elsõ tengely terhelés: 900kg</li>  \n	<li>Hátsó tengely terhelés: 810kg</li>  \n	<li>Tüv engedélyezése folyamatban</li>  \n</ul>  \n<p>Az <strong>MTS-Technik Comfort Series állítható magasságú sport futómű</strong> ideális választás azok számára, akik számára fontos a kényelem és a sportos megjelenés egyaránt. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz, biztosítva az optimális hasmagasságot. A <strong>MTS-Technik Comfort futóműveinek</strong> tökéletes összhangban vannak az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong>.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>  \n	<li>a <strong>Comfort Series</strong> célja a magas kényelem és nem az extrém ültetés</li>  \n	<li>gáztöltésű lengéscsillapítók</li>  \n	<li>kiemelkedő hatékonyság extrém igénybevételek esetén is</li>  \n	<li>két rétegű bevonat a hosszú távú korrózióvédelemért</li>  \n	<li>ideális rugó-lengéscsillapító összehang</li>  \n	<li>a készlet könnyen telepíthető, nem igényel módosításokat a felfüggesztésben</li>  \n</ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>  ', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6K), 1993.03-1999.07-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6k-1993-03-1999-07-ig-comfort-series-allithato-magassagu-futomu'),
(917, '', 'Ez a magasságállítható AP-Fahrwerke futómű megfelel a következő autótípusnak:</p>  <ul> 	<li>Seat Cordoba</li> 	<li>Tipuskód: 6K/C</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1993.11 - 1999.09</li> 	<li>Tengelyterhelés elöl (kg): 900</li> 	<li>Tengelyterhelés hátul (kg): 810</li> 	<li>Ez a futómű Németországból származik és rendelkezik Német TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br /> 	(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak ezekkel az értékekkel érvényes.)</li> 	<li>Extra ültetési lehetőség elöl: +55 mm, hátul: +80 mm</li> 	<li>Gyártó: Ap-Fahrwerke Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszám: GF81-003</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Seat Ibiza (Typ: 6K), 1993.08-1999.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-ibiza-typ-6k-1993-08-1999-09-ig-allithato-magassagu-futomu'),
(918, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: SEAT IBIZA</p> <ul>     <li><strong>Évjárat</strong>: 1993-1999</li>     <li><strong>Ültetés mértéke:</strong> 20 - 70 / 50 - 70 mm</li>     <li><strong>Típus</strong>: Seat Ibiza, Typ 6K</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 870 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 760 kg</li>     <li> </li> </ul> <p>Ezen kiegészítő nemcsak esztétikailag javítja az autó megjelenését, hanem fokozza a vezetési élményt is. A személyre szabható ültetési pozíció lehetőséget biztosít a felhasználó számára. A futómű kiváló minőségű, speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és dinamika között. Az első osztályú korrózióvédelem garantált a lengéscsillapítókon.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintező- vagy torziós futóművekkel felszerelt autókat.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968208</p>', 'Vogtland Seat Ibiza (Typ: 6K), 1993-1999-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6k-1993-1999-ig-allithato-magassagu-futomu'),
(919, '', '<strong>Seat Ibiza JOM BLUE LINE állítható magasságú futómû</strong></p>  <p>Ez a futómű a 6K2 típuskódú Seat Ibizához lett tervezve, gyártva 1999 és 2002 között.</p>  <p>Az elülső tengelyterhelés 900 kg, míg a hátsó tengelyterhelés 770 kg.</p>  <p>Ez a termék Made in Germany, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalál.</p>  <p>A futóművet 2 év teljeskörű garanciával szállítjuk!</p>  <p>Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulccsal.</p>  <p>Ez a kiváló minőségű futómű rendkívül jó áron kapható!</p>  <p>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot az állításhoz.</p>  ', 'Jom Bochum Seat Ibiza (Typ: 6K2), 1999-2002-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-ibiza-typ-6k2-1999-2002-ig-blue-line-allithato-magassagu-futomu'),
(920, '', '<div><strong>Seat Ibiza V-Maxx állítható futómű</strong></div> <div>Egyedi típus: 6K2</div> <div>Gyártási időszak: 1999-2002</div> <div>Elülső ültetési mérték: 40 - 80 mm</div> <div>Hátsó ültetési mérték: 40 - 80 mm</div> <div>Ez a termék rendelkezik TÜV engedéllyel!</div>', 'V-Maxx Seat Ibiza (Typ: 6K2), 1999-2002-ig állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-typ-6k2-1999-2002-ig-allithato-magassagu-futomu'),
(921, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû olyan autókhoz készült, mint a Seat Ibiza, 1999.10 és 2002.03 közötti évjáratú modellek (6K). A futómû tengelyterhelése elöl 900 kg. Fontos megjegyezni, hogy ez a futómû Német nyelvû TÜV engedéllyel rendelkezik. Az engedélyben meghatározott ültetési lehetőségek elöl 35-65 mm, hátul 35-65 mm között állíthatók, de ennél nagyobb intervallumban is módosíthatók. A TÜV engedély csak a fenti beállításokra vonatkozik. Extra ültetési lehetőség elöl +85 mm, hátul +80 mm. A futómû Németországban, az Ap-Fahrwerke gyárában készült. A termékre 2 év garancia vonatkozik.</p>  <p><strong>Cikkszáma: GF81-012</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div>', 'AP made by KW Seat Ibiza (Typ: 6K2), 1999.10-2002.03-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-ibiza-typ-6k2-1999-10-2002-03-ig-allithato-magassagu-futomu'),
(922, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: SEAT IBIZA</p> <ul>     <li><strong>Évjárat</strong>: 1999-2002-ig</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Seat Ibiza, Typ 6K, 2000-es (Facelift) modelltõl</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 900 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 810 kg</li> </ul> <p>A Vogtland állítható magasságú futómű szett nemcsak javítja az autó megjelenését, de emellett maximális vezetési élményt biztosít. Az ültetés mértékét könnyedén beállíthatja a saját igényei szerint. A futómű szett kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p> <p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968209</p>', 'Vogtland Seat Ibiza (Typ: 6K2), 1999-2002-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6k2-1999-2002-ig-allithato-magassagu-futomu'),
(923, '', '<p>Ülés Ibiza Jom Blueline állítható magasságú sport futómű</p>\\r\\n\\r\\n<p>Az autó típuskódja: 6L</p>\\r\\n\\r\\n<p>Évjárat: 2002-től kezdve</p>\\r\\n\\r\\n<p>A hátsó tengelyen a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>FONTOS! A futómű beszereléséhez bizonyos modellek esetében rövidített stabilizátor rúdra (kutyacsont) van szükség, mely nem tartozék ebben a szettben!</p>\\r\\n\\r\\n<p>Elülső tengelyterhelés: 960 kg</p>\\r\\n\\r\\n<p>Hátsó tengelyterhelés: 840 kg</p>\\r\\n\\r\\n<p>KÉSZÜLT NÉMETORSZÁGBAN</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>Kiemelkedő minőség, rendkívül kedvező áron!!!</p>\\r\\n\\r\\n<p>A csomag tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</p>\\r\\n', 'Jom Bochum Seat Ibiza (Typ: 6L), 2002-től, Blueline állítható magasságú futómű', '', '', '', 'jom-bochum-seat-ibiza-typ-6l-2002-tol-blueline-allithato-magassagu-futomu'),
(924, '', '<div>\\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">Kínálatunkban sportos futóművet találsz Seat Ibiza 6L típusú járművekhez, melyek állítható magasságúak és V-Maxx márkájúak.</p>\\n</div>', 'V-Maxx Seat Ibiza (Typ: 6L), 2002-től állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-typ-6l-2002-tol-allithato-magassagu-futomu'),
(925, '', '<strong>MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Skoda Fabia:</strong> 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> 	<li>Elülső ültetés: 15-60mm</li> 	<li>Hátsó ültetés: 15-60mm</li> 	<li>Elülső tengely terhelés: 960kg</li> 	<li>Hátsó tengely terhelés: 840kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Extrém igénybevételre is magas hatékonyság</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Rugó és lengéscsillapító tökéletes együttműködése</li> 	<li>Az összeállítás plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6L), 2002.02-2009.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6l-2002-02-2009-07-ig-street-series-allithato-magassagu-futomu'),
(926, '', '<p>Az MTS-Technik Sport sorozatú, állítható magasságú sport futóművei kiváló választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik Sport futóművei optimális összhangban vannak az Eibach rugókkal és MTS-Technik lengéscsillapítókkal, így maximális vezetési élményt nyújtanak széles ültetési tartománnyal.</p>\n\n<p><u>A következő típusokhoz kompatibilis:</u></p>\n<ul>\n	<li>Skoda Fabia, 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li>\n	<li>Ültetés mértéke elöl: 50-80mm</li>\n	<li>Ültetés mértéke hátul: 50-90mm</li>\n	<li>Elülső tengely terhelés: 960kg</li>\n	<li>Hátsó tengely terhelés: 840kg</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Seat Ibiza (Typ: 6L), 2002.02-2009.07-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-typ-6l-2002-02-2009-07-ig-sport-series-allithato-magassagu-futomu'),
(927, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">Az Seat Ibiza 6L-hez különböző sportos futómű beállítási lehetőségek elérhetőek</strong>\n</div>', 'V-Maxx Seat Ibiza (Typ: 6L), 2002-től, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-typ-6l-2002-tol-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(928, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: SEAT IBIZA</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2002.04-tõl</li>\n    <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>\n    <li><strong>Típus</strong>: Seat Ibiza, Typ 6L</li>\n    <li><strong>Max. tengelyterhelés elõl</strong>: 955 kg</li>\n    <li><strong>Max. tengelyterhelés hátu</strong>l: 840 kg</li>\n    <li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett optimális vezetési élményt nyújt. Az ültetés mértékét a felhasználó igényeinek megfelelően állíthatja be. A kiváló minőségű futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek esetében szintező- vagy torziós futóművet alkalmaznak.</p>\n<p>Németországban gyártva!</p>\n<p>Cikkszám: 968529</p>', 'Vogtland Seat Ibiza (Typ: 6L), 2002.04-től,(első tengely terhelés 955kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-ibiza-typ-6l-2002-04-tolels-tengely-terheles-955kg-alatt-allithato-magassagu-futomu'),
(929, '', '<div><strong>Seat Ibiza AP állítható magasságú sport futómű</strong></div>\\r\\n\\r\\n<div>\\r\\n<div>A sportosan ambiciózus vezető számára az AP futómű lehetőséget kínál arra, hogy a kívánt ülésmagasságot precízen beállíthassa. A sportos irányíthatóság és optimális vezetési tulajdonságok kombinációját nyújtjuk a maximális ültetés mellett.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyának megteremtése optimális konfigurációt biztosít.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n</div>\\r\\n', 'AP made by KW Seat Ibiza (Typ: 6L), 2002.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-ibiza-typ-6l-2002-04-tol-allithato-magassagu-futomu'),
(930, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás lehetnek azok számára, akik számára fontos a jó minőség és az előnyös ár. A magasság fokozatmentesen állítható, így könnyedén lehet alkalmazkodni az útviszonyokhoz. Az MTS-Technik futóműveiben optimális összhang van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém terhelés mellett is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében.</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Ibiza 5 (Typ: KJ1), 2017.01-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-5-typ-kj1-2017-01-tol-street-series-allithato-magassagu-futomu'),
(931, '', '<strong>Állítható magasságú sport futómű a Seat Ibiza 5 V-Maxx modellekhez</strong><br /><ul><br /><li>Az említett autótípusokhoz kapható futómű: 1.0 / 1.0MPI / 1.0TGI / 1.0TSI / 1.5TSI / 1.6TDI</li><br /><li>Az első ültetés módosítható tartománya: 40 - 70 mm</li><br /><li>A hátsó ültetés módosítható tartománya: 40 - 70 mm</li><br /><li>A felszereléshez szükséges egy rövidített stabilizátorrúd, ami külön vásárolható meg</li><br /><li>A futómű rendelkezik TÜV engedéllyel</li><br /><li>Garancia időtartama: 24 hónap</li><br /></ul><br /><p><em>A honlap tartalmának jogtalan másolása, reprodukálása szigorúan tilos és jogi következményekkel járhat!</em></p>', 'V-Maxx Seat Ibiza 5 (Typ: KJ1), 2017.01-től állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-5-typ-kj1-2017-01-tol-allithato-magassagu-futomu'),
(932, '', '<p><strong>Volkswagen Polo 6 Sport Series MTS-Technik állítható magasságú sport futómű</strong></p>\n<ul>\n	<li><strong>Volkswagen Polo 6 (Typ: AW, BZ),</strong> 1.0 / 1.0MPi / 1.0TGI / 1.0TSI / 1.5TSI / 2.0GTI / 1.6TDI</li>\n	<li>Ültetés mértéke elöl: 25-55mm</li>\n	<li>Ültetés mértéke hátul: 25-50mm</li>\n	<li>Első tengely terhelés: 1010kg</li>\n	<li>Hátsó tengely terhelés: 930kg</li>\n	<li>A termék TÜV engedéllyel rendelkezik!</li>\n</ul>\n<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális egyensúlyt biztosítanak az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között, ami maximális vezetési élményt nyújt a széles ültetési tartomány mellett.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány és a fokozott vezetési élmény volt a cél</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes egyensúly rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Ibiza 5 (Typ: KJ1), 2017.01-től, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-5-typ-kj1-2017-01-tol-sport-series-allithato-magassagu-futomu'),
(933, '', '<strong>Volkswagen Polo 6 Comfort Series MTS-Technik állítható magasságú sport futómű</strong></p>  \n\n<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó alvázának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik Comfort futóművei optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között.</p>  \n\n<p><u>Termékjellemzők:</u></p>  \n\n<ul>  \n	<li>az állítható magasságú futóművek rugóit az Eibach cég gyártja</li>  \n	<li>speciális Eibach rugók a maximális kényelem érdekében</li>  \n	<li>a Comfort Series létrehozása során a hangsúlyt a magas kényelemre helyezték</li>  \n	<li>gáztöltésű lengéscsillapítók</li>  \n	<li>magas hatékonyság extrém igénybevétel mellett</li>  \n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>  \n	<li>tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>  \n</ul>  \n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>  \n\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Seat Ibiza 5 (Typ: KJ1), 2017.01-től, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-ibiza-5-typ-kj1-2017-01-tol-comfort-series-allithato-magassagu-futomu'),
(934, '', '<strong>Seat Ibiza 5 V-Maxx állítható magasságú sport futómű átalakító készlet</strong><br /><br /><ul><br /><li>Az alábbi Seat Ibiza 5 modellekhez kompatibilis: 1.0 / 1.0MPI / 1.0TGI / 1.0TSI / 1.5TSI / 1.6TDI</li><br /><li>A készlet típusa: KJ1</li><br /><li>Az ültetés mértéke elöl: 40 - 70 mm</li><br /><li>Az ültetés mértéke hátul: 40 - 70 mm</li><br /><li>Keménység 20 fokozatban állítható</li><br /><li>Fontos: A beépítéshez rövidített stabilizátorrúd szükséges, mely nem tartozéka a csomagnak!</li><br /><li>A termék rendelkezik TÜV engedéllyel</li><br /><li>24 hónap garancia a termékre</li><br /></ul><br /><br /><em>Kérjük, ne másolja vagy sokszorosítsa weboldalunk szöveges tartalmát és képeit engedélyünk nélkül!</em>', 'V-Maxx Seat Ibiza 5 (Typ: KJ1), 2017.01-től, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-seat-ibiza-5-typ-kj1-2017-01-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(935, '', '<strong>Seat Leon JOM BLUE LINE állítható magasságú futómű</strong><br />\\r\\nAz autó alábbi specifikációkkal rendelkezik: Évjárat: 2001 - 2006, Typ.: 1M, Tengelyterhelés elöl: 1020 kg, Tengelyterhelés hátul: 1025 kg.<br />\\r\\nFontos! Ez a termék nem kompatibilis a Quattro modellekkel.<br />\\r\\nA futómű hátsó tengelyénél a magasságállító a rugó alatt található.<br />\\r\\nEz a futómű Made in Germany, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.<br />\\r\\nA termék 2 év teljeskörű garanciával kerül forgalomba.<br />\\r\\nA kiváló minőségű futóművet hihetetlenül jó áron kínáljuk.<br />\\r\\nA szett tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot.', 'Jom Bochum Seat Leon (Typ: 1M), kivéve 4-Motion, 1999-2005-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-leon-typ-1m-kiveve-4-motion-1999-2005-ig-blue-line-allithato-magassagu-futomu'),
(936, '', '<div>\\n<strong style=\\\\\\\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\\\\\\\">\\nA Seat Leon V-Maxx futóműve olyan sportfutóművel van szerelve, amelynek magassága állítható.\\n</strong>', 'V-Maxx Seat Leon (Typ: 1M), kivéve 4-Motion, 1999-2005-ig állítható magasságú futómű', '', '', '', 'v-maxx-seat-leon-typ-1m-kiveve-4-motion-1999-2005-ig-allithato-magassagu-futomu'),
(937, '', '<p><strong>Volkswagen Golf 4 MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  \n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>  \n<ul>  \n	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li>  \n	<li>Tartalmazza a Variant modellt</li>  \n	<li>Nem tartalmazza a 4-Motion változatot</li>  \n	<li>Első tengely terhelés: 1030kg</li>  \n	<li>Hátsó tengely terhelés: 1025kg</li> \n</ul>  \n<p>Az <strong>MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz! Az <strong>MTS-Technik Comfort állítható futóművei</strong>ben tökéletes az egyensúly az <strong>Eibach</strong> gyártotta rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>Különleges <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>  \n	<li>A <strong>Comfort Series</strong> kialakításakor nem az extrém alacsonyra ültetés, hanem a <strong>magas kényelem</strong> volt a fókuszban</li>  \n	<li>Gáztöltésű lengéscsillapítók</li>  \n	<li>Magas hatékonyság extrém terhelés esetén is</li>  \n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>  \n	<li>Tökéletes az egyensúly a rugók és a lengéscsillapítók között</li>  \n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> \n</ul>  \n<p><u><strong>Termék jellemzők:</strong></u></p>  \n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  \n<p><em>A weboldalon található szöveges tartalom és képek másolása, sokszorosítása engedély nélkül tilos!</em></p>  ', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1M), kivéve 4-Motion, 1999-2005-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1m-kiveve-4-motion-1999-2005-ig-comfort-series-allithato-magassagu-futomu'),
(938, '', '<strong>Állítható magasságú sport futómű</strong></p>  <p>Az állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik kiemelten fontosnak tartják a minőséget és az ár-érték arányt. A magasság fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az optimális egyensúlyt a rugók és a lengéscsillapítók között biztosítja az állítható futómű.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> ', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1M) 4-Motion, 2001.02-2004.05-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1m-4-motion-2001-02-2004-05-ig-allithato-magassagu-futomu'),
(939, '', '<p><strong>Állítható magasságú sport futómű</strong></p> <p><u>A következő járművekhez kompatibilis:</u></p> <ul> <li><strong>Volkswagen Golf 4</strong> 1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> <li>Variant modell is beleértve</li> <li>Nem kompatibilis a 4-Motion változattal</li> <li>Első tengely terhelés: 1030kg</li> <li>Hátsó tengely terhelés: 1025kg</li> </ul> <p>Az állítható magasságú sport futóművek tökéletes választás azok számára, akik nem szeretnének kompromisszumot kötni. A magasság könnyedén beállítható az útviszonyoknak megfelelően, így maximális vezetési élményt nyújtva. Az Eibach rugók és az MTS-Technik lengéscsillapítók tökéletes összhangban vannak, biztosítva a széles ültetési tartományt.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>A rugókat az Eibach gyártja</li> <li>Speciális Eibach rugók sportos vezetéshez</li> <li>A Sport Series célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Magas hatékonyság extrém igénybevétel mellett</li> <li>Korrózióvédelem két rétegű bevonattal</li> <li>Plug & play készlet, nem igényel módosítást</li> </ul> <p><u><strong>Termék jellemzői:</strong></u></p> <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p> <p><em>A weboldal tartalmának másolása, sokszorosítása engedély nélkül tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1M), kivéve 4-Motion, 1999-2005-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1m-kiveve-4-motion-1999-2005-ig-sport-series-allithato-magassagu-futomu'),
(940, '', '<div>\\n<p style=\"font-family: OpenSans-Regular, sans-serif; box-sizing: border-box; color: rgb(135, 135, 135); font-size: 13.3333px;\">\\nA Seat Leon V-Maxx sport futómű lehetővé teszi az állítható magasságot és keménységet.\\n</p>', 'V-Maxx Seat Leon (Typ: 1M), kivéve 4-Motion, 1999-2005-ig, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-seat-leon-typ-1m-kiveve-4-motion-1999-2005-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(941, '', '<p>A Vogtland állítható magasságú futómű szett kifejezetten a SEAT LEON típushoz lett tervezve. Ez a futómű kitűnő választás lehet, ha szeretnéd javítani autód megjelenését és maximalizálni vezetési élményed. Az ültetés mértéke állítható 30-50 mm-es tartományban, a maximális tengelyterhelés elöl és hátul egyaránt 1020 kg. A futómű tartalmaz speciális, nagy teljesítményű csöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú élettartamot biztosítanak.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968210</p>', 'Vogtland Seat Leon (Typ: 1M), kivéve Cupra-R, 1999.06-2006.03-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-1m-kiveve-cupra-r-1999-06-2006-03-ig-allithato-magassagu-futomu'),
(942, '', '<div>\n<p>Egy olyan futómű, amely állítható magassággal rendelkezik, és kompatibilis a Seat Leon autómodellekkel, kivéve a 4-Motion változatokat. Az 1999.11-től gyártott autókhoz ajánlott, és a tengelyterhelés elöl és hátul is 1020 kg lehet. Fontos kiemelni, hogy a gyári méretű gumiabroncsok és felnik esetén szükséges lehet nyomtávszélesítő felszerelése. A nagyobb átmérőjű feltengelyű modellek esetében javasolt lehet a stabilizátorrúd cseréje.</p>\n<p>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel, amely szerint az ültetés mértéke elöl és hátul 30-65 mm között állítható. A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a korábban említett beállításokra vonatkozik. Emellett van lehetőség plusz ültetésre elöl +45 mm, hátul +10 mm.</p>\n<p>A futómű Németországban, az Ap-Fahrwerke gyárában készül. A termékre 2 év garancia vonatkozik. A cikkszáma: GF10-005. Az ár egy szettre vonatkozik.</p>\n</div>', 'AP made by KW Seat Leon (Typ: 1M), kivéve 4-Motion, 1999.06-2005-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-1m-kiveve-4-motion-1999-06-2005-ig-allithato-magassagu-futomu'),
(943, '', '<p>A Vogtland által kínált állítható magasságú futómű szett ideális választás lehet a SEAT LEON modellekhez, melyeket 1999-től gyártanak. A futómű ültetés mértéke 30-55 / 30-55 mm között állítható, és specifikusan a Seat Leon Typ 1M, 4WD típusú autókhoz lett tervezve. Az elülső tengelyterhelés maximális értéke 1030 kg, míg a hátsóé 1020 kg.</p>\n<p>Ez a minőségi futómű szett garantálja, hogy az autó nemcsak esztétikailag mutatós lesz, hanem maximális vezetési élményt is biztosít. A kiegyensúlyozott komfort érdekében a kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel vannak ellátva, ami fokozott dinamikát eredményez. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968530</p>', 'Vogtland Seat Leon (Typ: 1M) 4-Motion, 1999.06-tól állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-1m-4-motion-1999-06-tol-allithato-magassagu-futomu'),
(944, '', '<div>\n  <p>Ez a <strong>magasságállítható futómű</strong> alkalmas az alábbi autótípusokhoz:</p>\n  <ul>\n    <li>VW Golf 4 4WD, Limousine, Variant 4 és 5 hengeres</li>\n    <li>Tipuskód: 1J</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 1999.04-től</li>\n    <li>Tengelyterhelés elöl (kg): 1050</li>\n    <li>Tengelyterhelés hátul (kg): 1060</li>\n    <li>Egyéb kitételek: -</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-55 mm, hátul: 30-55 mm között állítható<br />(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n    <li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: Ap-Fahrwerke, Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF80-031</strong></p>\n  <p><br />\n    Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Seat Leon (Typ: 1M) 4-Motion, 1999.06-2005-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-1m-4-motion-1999-06-2005-ig-allithato-magassagu-futomu'),
(945, '', '<strong>Seat Leon JOM BLUE LINE állítható magasságú futómű</strong><br /> Típuskód: 1P</p>  <p>Az autóban használható motorok: 1.4, 1.6, 2.0, 2.0T / DSG, 1.9TDi<br /> Gyártási év: 2005-től<br /> A magasságállító a hátsó tengelynél a rugó alatt található.<br /> Fontos tudnivaló: A futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szettnek!!<br /> Maximális tengelyterhelés elöl: 1105 kg<br /> Maximális tengelyterhelés hátul: 990 kg<br /> GERMANY-ban készült<br /> Ennek a futóműnek van német nyelvű TÜV engedélye, amelyet a csomagolás tartalmaz.<br /> 2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!<br /> Kiemelkedő minőség, rendkívül versenyképes áron!!!<br /> A csomag tartalma: 4 darab lengéscsillapító, hozzájuk tartozó rugókkal, valamint 1 darab állítókulccsal</p>', 'Jom Bochum Seat Leon (Typ: 1P), 1.4, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, 2005-től, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-leon-typ-1p-1-4-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-2005-tol-blue-line-allithato-magassagu-futomu'),
(946, '', '<strong>Seat Leon JOM BLUE LINE rugózállítású futómű</strong><br /> A Seat Leon JOM BLUE LINE futóműve rugózállítási lehetőséggel rendelkezik, melynek típuskódja: 1P.</p>  <p>A futómű motorválasztéka magában foglalja a 1.9TDi / DSG és 2.0TDi / DSG kiviteleket, melyek évjárata 2005-től elérhetőek.</p>  <p>A futómű hátsó tengelyének magasságállítója a rugó alatt található, és fontos megjegyezni, hogy a beszereléshez rövidített stabilizátor rúdra van szükség, mely nem része ennek a szettnek!</p>  <p>A tengelyterhelés elöl 1106-1200kg, míg hátul 990 kg.</p>  <p>A futómű MADE IN GERMANY minőségi termék, mely rendelkezik német nyelvű TÜV engedéllyel, amelyet a csomagolás tartalmaz.</p>  <p>A termék 2 ÉV TELJESKÖRŰ GARANCIÁVAL kapható, és kiváló minőségű, rendkívül vonzó áron!</p>  <p>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db kulccsal az állításhoz.', 'Jom Bochum Seat Leon (Typ: 1P), 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, 2005-től, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-leon-typ-1p-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-2005-tol-blue-line-allithato-magassagu-futomu'),
(947, '', '<strong>Audi A3 MTS-Technik állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható sport futóművei ideális választásnak bizonyulnak azoknak a vásárlóknak, akik számára fontos a kiváló minőség és az megfizethető ár. Az állítható magasság lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugók és lengéscsillapítók tökéletes összhangban vannak</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  ', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1P), 2005.08-tól, (első tengely terhelés 1036-1170kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1p-2005-08-tol-els-tengely-terheles-1036-1170kg-street-series-allithato-magassagu-futomu'),
(948, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik a minőséget és az ár-érték arányt helyezik előtérbe. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók tökéletes egyensúlyát kínálják. </p> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművek rugóit az Eibach gyártja</li> <li>A magasság széles skálán, legtöbb esetben 25 és 80 mm között állítható</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Extrém igénybevétel esetén is magas hatékonyság</li> <li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> <li>Rugó és lengéscsillapító tökéletes összhangja</li> <li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésén</li> </ul> <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1P), 2005.08-tól, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1p-2005-08-tol-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu'),
(949, '', '<p><strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  \n<p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futóművei</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az <strong>MTS-Technik Sport futóművei</strong> optimális összhangot teremtenek az <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>  \n<p>A következő típusokhoz:</p>  \n<ul>  \n	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>  \n	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>  \n	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li>  \n	<li>Első tengely terhelés: 1035kg alatt</li>  \n	<li>Hátsó tengely terhelés: 1150kg</li>  \n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>  \n	<li>Ültetés mértéke elől: 35-70mm</li>  \n	<li>Ültetés mértéke hátul: 35-60mm</li>  \n	<li>TÜV engedéllyel rendelkezik</li>  \n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>  \n	<li>a <strong>Sport sorozat</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>  \n	<li>gáztöltéses lengéscsillapítók</li>  \n	<li>magas hatékonyság extrém igénybevétel mellett is</li>  \n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1P), 2005.08-tól, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1p-2005-08-tol-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(950, '', '<p><strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futómű</strong> kiváló választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> tökéletes összhangban vannak az <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>  <p>Az alábbi típusokhoz alkalmas:</p>  <ul> 	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1036-1170kg</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elöl: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>a <strong>Sport sorozat</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li> 	<li>gáztöltetű lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p> ', 'MTS-Technik by Nord Performance Seat Leon (Typ: 1P), 2005.08-tól, (első tengely terhelés 1036-1170kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-1p-2005-08-tol-els-tengely-terheles-1036-1170kg-sport-series-allithato-magassagu-futomu'),
(951, '', '<div>\n<p>Ez a <strong>AP-Fahrwerke</strong> által gyártott állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n<ul>\n<li>VW Golf 6-hoz</li>\n<li>Lengéscsillapító átmérője: 50mm</li>\n<li>Tipuskódok: 1K, 1KP</li>\n<li>Típus variáció:</li>\n<li>Évjárat: 2008.10-től</li>\n<li>Tengelyterhelés elöl: 1060 kg</li>\n<li>Tengelyterhelés hátul: 1000 kg</li>\n<li>Egyéb kitételek: Kizárólag első lengéscsillapító-szár átmérője 50mm</li>\n</ul>\n<ul>\n<li>Ez a futómű Német nyelvű TÜV engedéllyel rendelkezik</li>\n<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható</li>\n<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +5 mm</li>\n</ul>\n<ul>\n<li>Termék gyártója: AP-Fahrwerke Németország</li>\n<li>Garancia időtartama: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF81-021</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Seat Leon (Typ: 1P), 2005.09-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-1p-2005-09-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(952, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípushoz:</p>  <ul> 	<li>VW Golf 6</li> 	<li>Lengéscsillapító átmérője: 50mm</li> 	<li>Tipuskód: 1K, 1KP</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2008.10-től</li> 	<li>Tengelyterhelés elöl (kg): 1170</li> 	<li>Tengelyterhelés hátul (kg): 1000</li> 	<li>Egyéb kitételek: Kizárólag nem négykerék-meghajtású modellekhez alkalmas!<br /> 	Csak olyan modellekhez, melyeknél az első lengéscsillapító-szár átmérője 50mm.</li> </ul>  <ul> 	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedély által előírt ültetési mérték elöl: 35-65 mm, hátul: 35-65 mm között állítható<br /> 	(Minden esetben nagyobb intervallumban állítható a futómű, azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li> 	<li>Extra ültetési lehetőség elöl: +10 mm, hátul: +5 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszám: GF81-022</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> ', 'AP made by KW Seat Leon (Typ: 1P), 2005.09-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-1p-2005-09-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(953, '', '<div><p>Ez a magasságállítható AP-Fahrwerke futómű az alábbi autótípushoz illeszkedik:</p>\n<ul>\n	<li>Seat Leon (beleértve: Cupra, R modellek)</li>\n	<li>Tipuskód: 1P</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2005.09-től</li>\n	<li>Tengelyterhelés elöl: 1170 kg</li>\n	<li>Tengelyterhelés hátul: 1000 kg</li>\n	<li>Egyéb információk: Kivéve négykerék-meghajtású modellek! Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez. Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.</li>\n</ul>\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +0 mm</li>\n</ul>\n<ul>\n	<li>Gyártó: Ap-Fahrwerke Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF81-032</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>\n</div>', 'AP made by KW Seat Leon (Typ: 1P), 2005.09-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-1p-2005-09-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(954, '', '<h2>Állítható magasságú futómű az AP-Fahrwerke-től</h2>\n<p>Ez a futómű megfelel az alábbi autótípusnak:</p>\n<ul>\n	<li>VW Golf 6 (beleértve a GTI-t)</li>\n	<li>Tipuskód: 1K, 1KP</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2008.10-től</li>\n	<li>Tengelyterhelés elöl: 1060 kg</li>\n	<li>Tengelyterhelés hátul: 1000 kg</li>\n	<li>Egyéb kitételek: Kivéve a négykerék-meghajtású modelleket. Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li>\n</ul>\n<ul>\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható. Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.</li>\n	<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +5 mm</li>\n</ul>\n<ul>\n	<li>Gyártva: AP-Fahrwerke Németországban</li>\n	<li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF81-031</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>', 'AP made by KW Seat Leon (Typ: 1P), 2005.09-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-1p-2005-09-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(955, '', '<strong>Vogtland</strong> futómű állítható készlet: SEAT LEON</p>  <ul> 	<li><strong>Gyártási év</strong>: 2005-től</li> 	<li><strong>Ültetés változása</strong>: 35 - 65 / 35 - 65 mm</li> 	<li><strong>Model</strong>: Seat Leon, Typ 1P, a lengéscsillapító ház átmérője 55 mm</li> 	<li><strong>Elülső tengely max. terhelése</strong>: (1060 kg felett) 1170 kg</li> 	<li><strong>Hátsó tengely max. terhelése</strong>: 1000 kg</li> 	<li><strong>Jóváhagyás</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett optimális vezetési élményt biztosít. Az ültetés mértékét az egyéni igényeknek megfelelően lehet beállítani. Ez a kiváló minőségű futómű készlet kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók rendelkezésre állnak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  <p>A készlet általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező- vagy torziós futóművet szereltek.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968548</p>', 'Vogtland Seat Leon (Typ: 1P), 2005.09-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-1p-2005-09-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(956, '', '<strong>Vogtland</strong> állítható magasságú futómű szett a SEAT LEON modellhez</p>  <ul> 	<li><strong>Évjárat</strong>: 2005-től</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 65 mm</li> 	<li><strong>Típus</strong>: Seat Leon, Typ 1P, lengéscsillapító ház átmérője 50 mm</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1170 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1000 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf</a></li> </ul>  <p>A Vogtland állítható magasságú futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát biztosít az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Készült Németországban!</p>  <p>Cikkszám: 968547</p>  ', 'Vogtland Seat Leon (Typ: 1P), 2005.09-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-1p-2005-09-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(957, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a SEAT LEON autókhoz. Ez a minőségi futómű szett speciális, nagy teljesítményű csöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. Az ültetés mértéke széles skálán állítható, így mindenki megtalálhatja a számára megfelelő beállítást. \n\nA futómű szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak ellátva. A lengéscsillapítók korrózióvédelme első osztályú, így hosszú távon is megőrzik minőségüket. A termék TÜV minősítéssel rendelkezik, valamint a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.\n\nA Vogtland futómű szett megjelenést és vezetési élményt egyaránt javít az autó számára. A maximális tengelyterhelés elöl 1060 kg, míg hátul 1000 kg. Az érvényesítéshez szükséges engedély elérhető a következő linken: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf\" target=\"_blank\">engedély</a>.\n\nA Vogtland futómű szett Made in Germany minősítéssel büszkélkedhet, és a cikkszáma: 968549.</p>', 'Vogtland Seat Leon (Typ: 1P), 2005.09-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-1p-2005-09-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(958, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett a SEAT LEON típusú autókhoz ideális választás, amelyek gyártási éve 2005-től kezdődik. Ennek a futómű szettnek az ültetés mértéke 35-65 / 35-65 mm között állítható. A Termék típusa: Seat Leon, Typ 1P, a lengéscsillapító ház átmérője pedig 50 mm. Az elülső tengely maximális terhelése legfeljebb 1060 kg, míg a hátsó tengelyé 1000 kg. A futómű engedélyezett és minősített az alábbi linken: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf</a>.</p>\n\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. Rugalmasan állítható ültetésének köszönhetően személyre szabottan alakítható. A kiváló minőségű futómű tartalmaz kétcsöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerrel rendelkeznek a kiegyensúlyozott komfort és a dinamika érdekében. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a tartóssághoz.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó már több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, így 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n<p>Cikkszám: 968546</p>', 'Vogtland Seat Leon (Typ: 1P), 2005.09-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-1p-2005-09-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(959, '', '<div><strong><span>Audi A3 (Típus: 8P) Bilstein B14 állítható magasságú futómű</span></strong><br />\\r\\n<br />\\r\\n<span>BILSTEIN egycsöves rendszer</span><br />\\r\\n<span>Fejtető alá helyezett technológia</span><br />\\r\\n<span>Versenysport rugók kiváló minőségű anyagból</span><br />\\r\\n<span>Állítható magasság (az alumíniumból készült rugótányér és kontra anya segítségével)</span><br />\\r\\n<span>Versenysport megoldások az utcai használatra, a B14-gyel a BILSTEIN mérnökei megvalósították ezt az elképzelést, amely jelentős előnyt biztosít. A B14 PSS-nél a jármű magassága az első és hátsó tengelyen akár 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelésre tervezett, fejtető alá helyezett egycsöves B14 PSS technológiája minden helyzetben kiegyensúlyozott vezetési élményt és vezetési örömöt nyújt.</span></div>\\r\\n', 'Bilstein Seat Leon (Typ: 1P), 2006.11-től, 50mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-seat-leon-typ-1p-2006-11-tol-50mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(960, '', '<div><strong><span>Audi A3 (Typ: 8P) Bilstein B14 állítható magasságú futómű</span></strong><br />\\r\\n<br />\\r\\n<span>BILSTEIN egycsöves rendszerrel</span><br />\\r\\n<span>Inverz technológiával</span><br />\\r\\n<span>Versenysportrugók kiváló minőségű anyagból</span><br />\\r\\n<span>Állítható magasságú (alumíniumból készült rugótányér és kontrakanyar)</span><br />\\r\\n<span>A B14 futómű a BILSTEIN mérnökeinek versenysport technológiáját viszi az utcára, lehetővé téve a jármű magasságának akár 50 mm-rel történő csökkentését az első és hátsó tengelynél egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű B14 Inverz technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetési élményt minden körülmény között.</span></div>\\r\\n', 'Bilstein Seat Leon Cupra R, 2009.09-től, 55mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-seat-leon-cupra-r-2009-09-tol-55mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(961, '', '<div><strong><span>Audi A3 (Típus: 8P) Bilstein B14 állítható magasságú futómű</span></strong><br />\\r\\n<br />\\r\\n<span>BILSTEIN egycsöves rendszerrel</span><br />\\r\\n<span>A fejjel lefelé technológiával</span><br />\\r\\n<span>Versenysportrugók magas szilárdságú anyagból</span><br />\\r\\n<span>Állítható magasságú rendszer (az alumíniumból készült rugótányér és kontra anya)</span><br />\\r\\n<span>Versenysport technológia az utakra, a B14-gyel a BILSTEIN mérnökei ezt valósították meg, ami jelentős előnyt jelent. A B14 PSS-nél a jármű magassága, az első és hátsó tengelynél max. 50 mm-rel csökkenthető, egy meghatározott 20 mm-es állítási tartományon belül. A B14 PSS extrém terhelhetőségű egycsöves fejjel lefelé technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben.</span></div>\\r\\n', 'Bilstein Seat Leon (Typ: 1P), 2006.11-től, 55mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-seat-leon-typ-1p-2006-11-tol-55mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(962, '', '<p>Az MTS-Technik kiváló minőségű és megfizethető árú állítható magasságú sport futóművei ideális választások azok számára, akik fontosnak tartják a minőséget és az ár-érték arányt. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiváló hatékonyság extrém igénybevételek esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Optimális egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 5F), csak MultiLink futóművel szerelt, beleértve 4-Motion, 2012.09-től, (első tengely terhelés 981-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-beleertve-4-motion-2012-09-tol-els-tengely-terheles-981-1180kg-allithato-magassagu-futomu'),
(963, '', '<p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat! Az útviszonyoknak megfelelően könnyedén beállítható a jármű hasmagassága, mivel fokozatmentesen állítható magassággal rendelkeznek. Az MTS-Technik futóművei a rugók és a lengéscsillapítók tökéletes egyensúlyát biztosítják.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>TÜV engedéllyel rendelkeznek</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 5F), kivéve MultiLink futóművel szerelt, beleértve 4-Motion, 2012.09-től, (első tengely terhelés 981-1140kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-5f-kiveve-multilink-futomuvel-szerelt-beleertve-4-motion-2012-09-tol-els-tengely-terheles-981-1140kg-allithato-magassagu-futomu'),
(964, '', '<p>A MTS-Technik által gyártott állítható magasságú sport futóművek ideális választást jelentenek azoknak, akik számára fontos a kiváló minőség és az elérhető ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. A MTS-Technik futóműveit jellemzi az optimális egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach gyártja</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonattal ellátva a hosszú élettartam érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 5F), csak MultiLink futóművel szerelt, beleértve 4-Motion, 2012.09-től, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-beleertve-4-motion-2012-09-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(965, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik fontosnak tartják a kiváló minőséget és az elérhető árat. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz, és beállíthatja az autó hasmagasságát. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach cég gyártja</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: 5F), kivéve MultiLink futóművel szerelt, beleértve 4-Motion, 2012.09-től, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-5f-kiveve-multilink-futomuvel-szerelt-beleertve-4-motion-2012-09-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(966, '', '<div><span>Az Ap futómű megoldást nyújt a dinamikus vezetés kedvelőinek arra, hogy a jármű ültetését pontosan beállíthassák. A maximális ültetés és sportos irányíthatóság tökéletes kombinációját kínáljuk.</span></div>  <div>Egy alumínium rugótányér segítségével a jármű magasságát könnyedén beállíthatja az engedélyezett tartományon belül. Az egyensúly a sportosság, kényelem és biztonság között optimális felhasználói élményt nyújt.</div>  <ul> 	<li>prémium minőség elérhető áron</li> 	<li>egyedi magasságállítás a TÜV által jóváhagyott határok között</li> 	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>kivételes ár-érték arány</li> 	<li>német minőség és megbízhatóság</li> </ul>', 'AP made by KW Seat Leon (Typ: 5F), csak Multilink futóművel szerelt, kivéve Cupra, Kombi, 2012.09-től, (első tengely terhelés 1080kg alatt), 55mm-es szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-kiveve-cupra-kombi-2012-09-tol-els-tengely-terheles-1080kg-alatt-55mm-es-szaratmer-allithato-magassagu-futomu'),
(967, '', '<div><span>Az Ap futómű tökéletes választás a vezetők számára, akik szeretnék testreszabni autójuk ültetését. A sportos irányíthatóság és optimális vezetési élmény garantált, miközben milliméterre beállítható az ültetés.</span></div>  <div>Egy alumínium rugótányér segítségével könnyedén beállítható a jármű magassága a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság tökéletes összhangban van az optimális felépítés érdekében.</div>  <ul> 	<li>kiváló minőségű termék megfizethető áron</li> 	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány biztosított</li> 	<li>kimagasló ár-érték arány</li> 	<li>német minőségű kivitelezés</li> </ul>', 'AP made by KW Seat Leon (Typ: 5F) Cupra 265, Cupra 280, 2014.03-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-5f-cupra-265-cupra-280-2014-03-tol-allithato-magassagu-futomu'),
(968, '', '<div><span>Az Ap futómű a sportosan ambiciózus vezetők számára lehetőséget biztosít, hogy milliméterre pontosan beállítsák a kívánt ültetést. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját kínáljuk a maximális ültetéssel összekötve.</span></div> <div><span>A járműmagasságot egy alumínium rugótányér segítségével egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, a kényelem és a biztonság összehangolása egy optimális felépítést eredményez.</span></div> <ul>     <li><span>Magas minőségű termék megfizethető áron</span></li>     <li><span>Egyéni magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiemelkedő ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul> <div><span>Fontos tudni! Ebben a futóműben csak a magasság állítható, a keménység nem!</span></div>', 'AP made by KW Seat Leon (Typ: 5F), kivéve Cupra, Kombi és Multilink futóművel szerelt, 2012.09-től, (első tengely terhelés 966-1080kg), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-5f-kiveve-cupra-kombi-es-multilink-futomuvel-szerelt-2012-09-tol-els-tengely-terheles-966-1080kg-50mm-es-szaratmer-allithato-magassagu-futomu'),
(969, '', '<div><span>Az Ap futómű azoknak szól, akik szeretik a sportos vezetést és precízen beállítani szeretnék a jármű ültetését. A sportos irányíthatóság és optimális vezetési tulajdonságokat a maximális ültetéssel kombináljuk.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetőség van a járműmagasságot egyénileg beállítani a TÜV által engedélyezett tartományban belül. A sportosságot, kényelmet és biztonságot összehangolva optimális felépítést biztosítunk.</span></div> <ul>     <li><span>Magas minőségű alkatrészek megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiemelkedő ár-érték arány</span></li>     <li><span>Német minőségű</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasságot lehet állítani, a keménység nem módosítható!</span></div>', 'AP made by KW Seat Leon (Typ: 5F), csak Multilink futóművel szerelt, kivéve Cupra, Kombi, 2012.09-től, (első tengely terhelés 965kg alatt), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-kiveve-cupra-kombi-2012-09-tol-els-tengely-terheles-965kg-alatt-50mm-es-szaratmer-allithato-magassagu-futomu'),
(970, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, akik számára fontos, hogy járművüket milliméter pontosan beállíthassák. Az optimális vezetési magatartást és sportos irányíthatóságot maximalizáló ültetési lehetőséget biztosítunk.</span></div> <div><span>A járműmagasság egyénileg beállítható egy alumínium rugótányér segítségével, amely a TÜV által engedélyezett tartományban mozgatható. A sportosság, kényelem és biztonság összehangolása optimális felhasználói élményt nyújt.</span></div> <ul>     <li><span>Kiemelkedő minőség kedvező áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár-érték arány</span></li>     <li><span>Német minőségű</span></li> </ul> <div><span>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</span></div>', 'AP made by KW Seat Leon (Typ: 5F), csak Multilink futóművel szerelt, kivéve Cupra, Kombi, 2012.09-től, (első tengely terhelés 966-1080kg), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-kiveve-cupra-kombi-2012-09-tol-els-tengely-terheles-966-1080kg-50mm-es-szaratmer-allithato-magassagu-futomu'),
(971, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözésével maximalizáljuk az ültetést.</span></div>\\r\\n\\r\\n<div>A járműmagasság egyénileg beállítható egy alumínium rugótányér segítségével a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmóniáját egy optimális felépítésben ötvözzük.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiemelkedő minőség kedvező áron</li>\\r\\n	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kivételes ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos! Csak a futómű magassága állítható, a keménység nem!</div>\\r\\n', 'AP made by KW  Seat Leon (Typ: 5F), kivéve Cupra, Kombi és Multilink futóművel szerelt, 2012.09-től, (első tengely terhelés 965kg alatt), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw--seat-leon-typ-5f-kiveve-cupra-kombi-es-multilink-futomuvel-szerelt-2012-09-tol-els-tengely-terheles-965kg-alatt-50mm-es-szaratmer-allithato-magassagu-futomu'),
(972, '', '<div><strong>Seat Leon (Typ: 5F) ST AP made by KW állítható futómû</strong></div>\r\n\r\n<ul>\r\n	<li>Csak Multilink futómûvel szerelt</li>\r\n	<li>Szárátmérõ: 55mm</li>\r\n	<li>Kvéve 4-Motion</li>\r\n	<li>Elsõ tengely terhelés 966-1090kg</li>\r\n	<li>Hátsó tengely terhelés 1050kg alatt</li>\r\n	<li>Ültetés mértéke elõl: 35-65mm</li>\r\n	<li>Ültetés mértéke hátsó: 35-65mm</li>\r\n</ul>\r\n\r\n<div>\r\n<p>Az Ap futómû a sportosan ambiciózus vezetõnek kínálja azt a lehetõséget, hogy az általa kívánt ültetést milliméter pontosan beállíthassa. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</p>\r\n\r\n<p>Egy alumínium rugótányér segítségével lehetõség van a jármûmagasságot a TÜV által engedélyezett tartományban egyénileg beállítani. A sportosság, a kényelem és a biztonság párhuzamos összehangolása egy optimális felépítést biztosít</p>\r\n\r\n<ul>\r\n	<li>kiváló minõség megfizethetõ áron</li>\r\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\r\n	<li>kiváló minõségû alkatrészek és TÜV tanúsítvány</li>\r\n	<li>egyedüláló ár/érték arány</li>\r\n	<li>német minõség</li>\r\n</ul>\r\n\r\n<p>Figyelem! Ennél a futómûnél csak a magasság állítható! A keménység NEM!</p>\r\n</div>\r\n', 'AP made by KW Seat Leon (Typ: 5F) ST Kombi, csak Multilink futóművel szerelt, kivéve 4-Motion, 2012.09-től, (első tengely terhelés 966-1090kg), 55mm-es szárátmérő, ST X állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-leon-typ-5f-st-kombi-csak-multilink-futomuvel-szerelt-kiveve-4-motion-2012-09-tol-els-tengely-terheles-966-1090kg-55mm-es-szaratmer-st-x-allithato-magassagu-futomu'),
(973, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: SEAT LEON</span></div> <ul>     <li><strong>Évjárat</strong>: 2012.11-től</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Seat Leon, Typ 5F, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérő 55 mm</li>     <li><strong>Max. tengelyterhelés elől</strong>: 1080 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 980 kg</li> </ul> <p>Az autó megjelenésének javítása mellett maximális vezetési élményt biztosít ez a futómű szett. Az ültetés mértékét a felhasználó saját elképzelése szerint állíthatja be. A csöves lengéscsillapítók alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát biztosít az ültető rugókra és a lengéscsillapítókra.</p> <p>A szett tartalmaz általában 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968738</p>', 'Vogtland Seat Leon (Typ: 5F), csak Multilink futóművel szerelt, kivéve Cupra, Kombi, 2012.09-től, (első tengely terhelés 1080kg alatt), 55mm-es szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-kiveve-cupra-kombi-2012-09-tol-els-tengely-terheles-1080kg-alatt-55mm-es-szaratmer-allithato-magassagu-futomu'),
(974, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SEAT LEON</span></div> <ul>     <li><strong>Évjárat</strong>: 2012-tõl</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Seat Leon, Typ 5F, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 50 mm</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 1060 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 980 kg</li> </ul> <p>Az autó megjelenésén javító és maximális vezetési élményt biztosító készlet. A személyre szabható ültetés mértéke lehetővé teszi az egyéni beállításokat. A futómű tartalmaz nagy teljesítményű csöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme elsőosztályú.</p> <p>A termék TÜV minősítéssel rendelkezik, a gyártó cég pedig 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve a szintező vagy torziós futóművel szerelt autóknál.</p> <p>Made in Germany!</p> <p>Cikkszám: 968744</p>', 'Vogtland Seat Leon (Typ: 5F), kivéve Cupra, Kombi és Multilink futóművel szerelt, 2012.09-től, (első tengely terhelés 966-1080kg), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-5f-kiveve-cupra-kombi-es-multilink-futomuvel-szerelt-2012-09-tol-els-tengely-terheles-966-1080kg-50mm-es-szaratmer-allithato-magassagu-futomu'),
(975, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SEAT LEON</span></div> <ul>     <li><strong>Évjárat</strong>: 2012-tõl</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Seat Leon, Typ 5F, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 50 mm</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 965 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 980 kg</li> </ul> <p>Amellett hogy javítja az autó megjelenését maximális vezetési élményt biztosít. A megfelelõ értékek között állíthatja az ültetés mértékét a saját elképzése alapján. Ez a minõségi futómû szett csak speciális, nagy teljesítményû csöves lengéscsillapítókat tartalmaz, amelyek az alacsony nyomású gázrendszernek köszönhetõen biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítókon elsõ osztályú a korrózió védelem.</p> <p>A termék TÜV minõsítéssel rendelkezik. A gyártó cég, amely a rugó gyártás terén már több mint 100 éves tapasztalattal rendelkezik, az ültetõ rugókra és a lengéscsillapítókra 2 év garanciát biztosít!</p> <p>A szett tartalma alapesetben 4 db ültetõ rugó, és 4 db lengéscsillapító, kivéve azoknál az autótípusoknál, amelyeket szintezõs vagy torziós futómûvel szereltek.</p> <p>Made in Germany!</p> <p>Cikkszám: 968741', 'Vogtland Seat Leon (Typ: 5F), kivéve Cupra, Kombi és Multilink futóművel szerelt, 2012.09-től, (első tengely terhelés 965kg alatt), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-5f-kiveve-cupra-kombi-es-multilink-futomuvel-szerelt-2012-09-tol-els-tengely-terheles-965kg-alatt-50mm-es-szaratmer-allithato-magassagu-futomu'),
(976, '', '<div><strong>Vogtland</strong><span> állítható futómű szett</span><span>: SEAT LEON</span></div> <ul>     <li><strong>Évjárat</strong>: 12012-től</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Seat Leon, Typ 5F, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 50 mm</li>     <li><strong>Max. tengelyterhelés elöl</strong>: 1080 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 980 kg</li>     <li> </li> </ul> <p>A Vogtland állítható futómű szett nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetés mértékét az egyéni igényeknek megfelelően lehet beállítani. Ez a futómű szett kizárólag speciális, nagy teljesítményű csővel ellátott lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p> <p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeket szintező vagy torziós futóművel szereltek.</p> <p>Made in Germany!</p> <p>Cikkszám: 968736</p>', 'Vogtland Seat Leon (Typ: 5F), csak Multilink futóművel szerelt, kivéve Cupra, Kombi, 2012.09-től, (első tengely terhelés 966-1080kg), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-kiveve-cupra-kombi-2012-09-tol-els-tengely-terheles-966-1080kg-50mm-es-szaratmer-allithato-magassagu-futomu'),
(977, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SEAT LEON</span></div> <ul>     <li><strong>Évjárat</strong>: 2012-tõl</li>     <li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Seat Leon, Typ 5F, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 50 mm</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 965 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 980 kg</li> </ul> <p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is fokozza. Az ültetés mértékét könnyedén személyre szabhatja az igényei szerint. Ez a kiváló minőségű futómű szett kizárólag magas teljesítményű csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítva a kiegyensúlyozott komfortot és dinamikát. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát nyújt az ültető rugókra és a lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968734</p>', 'Vogtland Seat Leon (Typ: 5F), csak Multilink futóművel szerelt, kivéve Cupra, Kombi, 2012.09-től, (első tengely terhelés 965kg alatt), 50mm-es szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-seat-leon-typ-5f-csak-multilink-futomuvel-szerelt-kiveve-cupra-kombi-2012-09-tol-els-tengely-terheles-965kg-alatt-50mm-es-szaratmer-allithato-magassagu-futomu'),
(978, '', '<p>Egy prémium minőségű autó-specifikus futómű, amely lehetővé teszi az egyéni magasságbeállítást az előre meghatározott paraméterek keretein belül. A rugó keménysége és a csillapítás mértéke teljes tartományban azonos marad. Kiemelkedő kanyarstabilitást biztosít a keresztirányú erők elleni nagy ellenállásának köszönhetően.</p>', 'Jom Bochum Seat Leon (Typ: KL), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-seat-leon-typ-kl-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(979, '', '<p><strong>Seat Leon JOM Blueline állítható magasságú sport futómű</strong></p>\n\n<ul>\n	<li><strong>Seat Leon (Typ: KL), 2019.11-től</strong></li>\n	<li><strong>Kivéve Multilink futóművel szerelt típusokhoz</strong></li>\n	<li>Első tengely terhelés: 1036-1100 kg</li>\n	<li>Hátsó tengely terhelés: 980 kg alatt</li>\n	<li>Fontos! A beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott! A szett NEM tartalmazza!</li>\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedély által meghatározott ültetés mértéke elöl: 20-55mm, hátul: 30-55mm között állítható<br />(A futómű szinte minden esetben ennél nagyobb intervallumban állítható, de a TÜV engedély csak a fent említett beállításokat fogadja el.)</li>\n</ul>\n\n<ul>\n	<li>Gyártva JOM Németországban</li>\n</ul>\n\n<p><strong>Cikkszáma: </strong>741239</p>\n\n<p>A JOM Blueline Állítható magasságú futóműszett prémium minőségű, autó-specifikus alkatrészekből áll.</p>\n\n<p>A magasság beállítása testreszabható az egyéni igényeknek megfelelően a fent említett paraméterek között.</p>\n\n<p>A rugók keménysége és a csillapítás mértéke állandó az egész beállítási tartományban.</p>\n\n<p>Kiemelkedően nagy kanyarstabilitást nyújt, mivel rendkívül ellenáll a keresztirányú erőknek.</p>', 'Jom Bochum Seat Leon (Typ: KL), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 1036-1100kg) állítható magasságú futómű', '', '', '', 'jom-bochum-seat-leon-typ-kl-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-1036-1100kg-allithato-magassagu-futomu'),
(980, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. A futómű magassága fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveinél a rugók és a lengéscsillapítók optimális egyensúlyban vannak.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>a termék rendelkezik TÜV engedéllyel</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>tökéletes egyensúly rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: KL), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-kl-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(981, '', '<p>A MTS-Technik által készített sport futóművek ideális választás azoknak, akik a minőséget és megfizethető árat tartják fontosnak. A futómű magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlya van.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n    <li>A futóművek rugóit az Eibach cég gyártja</li>\n    <li>A termék TÜV engedéllyel rendelkezik</li>\n    <li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém igénybevétel mellett</li>\n    <li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n    <li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n    <li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: KL), csak Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-kl-csak-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(982, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár! A fokozatmentesen állítható magasságnak köszönhetően könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók között tökéletes egyensúlyt biztosítanak.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li>A termék rendelkezik TÜV engedéllyel</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>A futómű rugói és lengéscsillapítói között tökéletes harmónia</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: KL), csak Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-kl-csak-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(983, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak a vásárlóknak, akik számára fontos a kiváló minőség és a versenyképes ár. Ez a futómű fokozatmentesen állítható magassággal rendelkezik, így könnyedén testreszabható az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiváló egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach gyártja</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>A magasság széles skálán, általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében: sárga cinkbevonat és fekete anódizált alumínium alkatrészek</li>\n	<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel változtatásokat az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Seat Leon (Typ: KL), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-leon-typ-kl-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(984, '', '<p>Ez a JOM Blueline Állítható magasságú futóművet tervezett az alábbi autótípushoz:</p>\n<ul>\n	<li>VW UP</li>\n	<li>Tipuskód: AA</li>\n	<li>Évjárat: 2011.12-től</li>\n	<li>Tengelyterhelés elöl (kg): 680</li>\n	<li>Tengelyterhelés hátul (kg): 640</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>A beépített ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható<br />\\r\\n	(A futómű más beállításokkal is használható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n</ul>', 'Jom Bochum Seat Mii (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'jom-bochum-seat-mii-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(985, '', '<strong>A Seat Mii V-Maxx futóművének magassága és keménysége állítható</strong><br />A jármű gyártási éve: 2011.12-től<br />Az elülső ültetés csökkenthető mértéke: 30-60mm<br />A hátsó ültetés csökkenthető mértéke: 30-50mm<br />Kérjük, vegye figyelembe, hogy a futómű beépítéséhez rövidített stabilizátorrudat kell használni!<br />TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/60%20VS%2014.pdf\\\">https://www.v-maxx.com/files/TUV/60%20VS%2014.pdf</a>', 'V-Maxx Seat Mii (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'v-maxx-seat-mii-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(986, '', '<p>Ez az állítható magasságú futómű passzol a következő autótípushoz:</p>\n<ul>\n	<li>VW UP</li>\n	<li>Tipuskód: AA</li>\n	<li>Évjárat: 2011.12-től</li>\n	<li>Tengelyterhelés elöl (kg): 680</li>\n	<li>Tengelyterhelés hátul (kg): 640</li>\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható\n		(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +5 mm</li>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia a termékre: 2 év</li>\n</ul>\n<p><strong>Cikkszáma: </strong>1158000C</p>\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Seat Mii (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-mii-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(987, '', '<strong>Vogtland</strong> állítható magasságú futómû szett: SEAT MII</p>  <ul> 	<li><strong>Évjárat</strong>: 2011.12-tõl</li> 	<li><strong>Ültetés mértéke</strong>: 30 - 60 / 30 - 60 mm</li> 	<li><strong>Típus</strong>: Seat Mii, Typ AA</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 680 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 640 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF0C_1237-14.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW800GF0C_1237-14.pdf</a></li> </ul>  <p>A Vogtland állítható magasságú futómű szett kiváló választás a SEAT MII modellekhez. Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is biztosít. A szett lehetőséget nyújt az ültetés mértékének személyre szabására, így mindenki megtalálhatja a számára ideális beállítást. A kiváló minőségű futómű tartalmaz speciális, nagy teljesítményű csöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is optimális teljesítményt nyújtanak.</p>  <p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968731</p>  ', 'Vogtland Seat Mii (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'vogtland-seat-mii-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(988, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. A futómű könnyedén állítható a útviszonyoknak megfelelően, így biztosítva az optimális hasmagasságot. Az MTS-Technik futóművei a rugók és a lengéscsillapítók tökéletes összhangját biztosítják.</p>\n\n<p><u>Alábbi típusokhoz kompatibilis:</u></p>\n\n<ul>\n	<li>Volkswagen Tiguan (Typ: AD1, AX1), 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1101-1240kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Rugó erősség (első, fő rugó): 45 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, engedélyezés folyamatban</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Tarraco, 2.0TSi 4Drive, 2.0TFSi 4Drive, 2.0TDi 4Drive, 2018.09-től, (első tengely terhelés 1101-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-tarraco-2-0tsi-4drive-2-0tfsi-4drive-2-0tdi-4drive-2018-09-tol-els-tengely-terheles-1101-1240kg-street-series-allithato-magassagu-futomu'),
(989, '', '<p>Egy kiváló választás az MTS-Technik állítható magasságú sport futóműve, amely a jó minőséget és kedvező árat egyesíti! Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően, köszönhetően a fokozatmentesen állítható magasságnak. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Az alábbi típusokhoz passzol:</u></p>\n\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1),</strong> 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1060kg</li>\n	<li>Hátsó tengely terhelés: 1390kg</li>\n	<li>Rugó erősség (első, fő rugó): 40 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 55 N/mm</li>\n	<li>TÜV engedéllyel nem rendelkezik! Engedélyezése folyamatban!</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Seat Tarraco, 1.5TSi ACT, 2.0TDi, 2018.09-től, (első tengely terhelés 1090kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-tarraco-1-5tsi-act-2-0tdi-2018-09-tol-els-tengely-terheles-1090kg-alatt-street-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(990, '', '<p>A Volkswagen Tiguan MTS-Technik Street általános célú sport futóművei ideális választás azoknak, akik kiemelkedő minőséget és megfizethető árat keresnek! A futómű könnyedén állítható a útviszonyokhoz igazítva, így könnyen beállítható az autó magassága. Az MTS-Technik futóműveinek rugalmas és lengéscsillapító elemei optimális egyensúlyban vannak. </p>\\r\\n\\r\\n<p><u>A termék a következő típusokhoz alkalmas:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1), </strong>1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\\r\\n	<li>Elülső ültetés: 35-55mm</li>\\r\\n	<li>Hátsó ültetés: 30-55mm</li>\\r\\n	<li>Elülső tengely terhelés: 1061-1190kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1390kg</li>\\r\\n	<li>Rugó erősség elöl: 45 N/mm</li>\\r\\n	<li>Rugó erősség hátul: 55 N/mm</li>\\r\\n	<li>Nincs TÜV engedély! Engedélyezés folyamatban!</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>A magasság legtöbb esetben 25 és 80 mm között állítható</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\\r\\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>Rugalmas és lengéscsillapítók tökéletes összhangban</li>\\r\\n	<li>Plug & play kialakítás, nem igényel módosításokat az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><u><strong>Termék jellemzői:</strong></u></p>\\r\\n\\r\\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\\r\\n\\r\\n<p><em>A weblap tartalmának és képeinek engedély nélküli másolása tilos!</em></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p> </p>', 'MTS-Technik by Nord Performance Seat Tarraco, 1.5TSi ACT, 2.0TDi, 2018.09-től, (első tengely terhelés 1091-1190kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-tarraco-1-5tsi-act-2-0tdi-2018-09-tol-els-tengely-terheles-1091-1190kg-street-series-allithato-magassagu-futomu'),
(991, '', '<p><strong>Seat Toledo Jom Blueline állítható magasságú futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Seat Toledo autómodell</li>\\r\\n	<li>Gyártási időszak: 1991 - 1999</li>\\r\\n	<li>Típus: 1L</li>\\r\\n	<li>Elülső tengelyterhelés: 955 kg</li>\\r\\n	<li>Hátsó tengelyterhelés: 820 kg</li>\\r\\n	<li>Gyártás helye: NÉMETORSZÁG</li>\\r\\n	<li>2 éves teljes körű garancia!!!</li>\\r\\n	<li>Magas minőségű termék, rendkívül kedvező áron!!!</li>\\r\\n	<li>A csomag tartalma: 4 darab lengéscsillapító, hozzá tartozó rugókkal és 1 darab kulccsal az állításhoz</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Seat Toledo (Typ: 1L), 1991-1999-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-toledo-typ-1l-1991-1999-ig-blue-line-allithato-magassagu-futomu'),
(992, '', '<p><strong>MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Golf 3 Cabrio, </strong>1.6 / 1.8 / 1.9 TDI / 2.0</li>\\r\\n	<li><strong>Volkswagen Golf 4 Cabrio, </strong>1.6 / 1.8 / 1.9 TDI / 2.0</li>\\r\\n	<li>Ültetés mértéke elõl: 25-80mm</li>\\r\\n	<li>Ültetés mértéke hátul: 25-80m</li>\\r\\n	<li>Rugó erõsség (elsõ, fõ rugó): 60 N/mm</li>\\r\\n	<li>Rugó erõsség (elsõ, segéd rugó): 20 N/mm</li>\\r\\n	<li>Rugó erõsség (hátsó, fõ rugó): 60 N/mm</li>\\r\\n	<li>Rugó erõsség (hátsó, segéd rugó): 20 N/mm</li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodjunk az útviszonyokhoz és a gépjármű hasmagasságához. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát kínálják.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>ez a futómű rendelkezik TÜV engedéllyel</strong></li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltéses lengéscsillapítók</li>\\r\\n	<li>kiemelkedő hatékonyság extrém terhelés mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 1L), 1991-1999-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-1l-1991-1999-ig-street-series-allithato-magassagu-futomu'),
(993, '', 'Ez az állítható magasságú futómű kompatibilis a Seat Toledo típusú autókkal, melyekhez a 1991.09-től gyártott modellek tartoznak. A futómű Németországban készült, és rendelkezik Német nyelvű TÜV engedéllyel. Az engedélyben meghatározott ültetés mértéke elöl 20-70 mm, hátul pedig 30-70 mm között állítható. Emellett plusz ültetésre is lehetőség van: elöl +60 mm, hátul +50 mm. A termékre 2 év garancia vonatkozik. A cikkszáma: GF81-001. Az ár 1 szettre vonatkozik.', 'AP made by KW Seat Toledo (Typ: 1L), 1991.02-1999-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-toledo-typ-1l-1991-02-1999-ig-allithato-magassagu-futomu'),
(994, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a SEAT TOLEDO autótulajdonosok számára. Az érvényes évjárat 1991-1999, és az ültetés mértéke 20 - 70 / 30 - 70 mm lehet. Ez a futómű szett kifejezetten a Seat Toledo, Typ 1L típushoz készült, és a maximális tengelyterhelés elöl 865 kg, míg hátul 790 kg lehet.</p>\n\n<p>Ez a kiváló minőségű futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A beállítások segítségével testre szabhatja az autó üléspozícióját az egyéni igényei szerint. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítják a kiegyensúlyozott komfortot és a dinamikus vezetési élményt. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>A termék \"Made in Germany!\" jelzéssel rendelkezik, és a cikkszáma: 968682.</p>', 'Vogtland Seat Toledo (Typ: 1L), 1991.02-1999-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-toledo-typ-1l-1991-02-1999-ig-allithato-magassagu-futomu'),
(995, '', '<strong>Seat Leon JOM BLUE LINE állítható magasságú futómű</strong><br />\\r\\nAz autó egy olyan modellje, amelyet 2001 és 2006 között gyártottak, a típusa 1M. Az autó első tengelyén 1020 kg, míg a hátsó tengelyén 1025 kg a tengelyterhelés. Fontos megjegyezni, hogy a futómű nem kompatibilis a Quattro modellekkel. A futómű hátsó tengelyén a magasságállító a rugó alatt található. A termék MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, amelyet a csomag is tartalmaz. Emellett 2 év teljeskörű garanciát biztosítunk rá! A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot az állításhoz.</p>\\r\\n', 'Jom Bochum Seat Toledo (Typ: 1M), 1999-2005-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-toledo-typ-1m-1999-2005-ig-blue-line-allithato-magassagu-futomu'),
(996, '', '<strong>Volkswagen Golf 4 MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Beleértve a Variant modellt</li> 	<li>Nem kompatibilis a 4-Motion változattal</li> 	<li>Első tengely maximális terhelése: 1030kg</li> 	<li>Hátsó tengely maximális terhelése: 1025kg</li> </ul>  <p>Az <strong>MTS-Technik Comfort sorozatú állítható magasságú sport futómű</strong> ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Comfort állítható futómű</strong> kiváló egyensúlyban van az <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong>.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Különleges <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>A <strong>Comfort sorozat</strong> létrehozásakor nem az extrém alacsony ülésmagasságra, hanem a <strong>magas kényelemre</strong> helyezték a hangsúlyt</li> 	<li>Gázamortizátoros lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása szigorúan tilos!</em></p> ', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 1M), kivéve 4-Motion, 1999.03-2004.10-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-1m-kiveve-4-motion-1999-03-2004-10-ig-comfort-series-allithato-magassagu-futomu'),
(997, '', '<p><strong>Állítható magasságú sport futómű a Volkswagen Golf 4-hez</strong></p> <p><u>Az alábbi típusokhoz passzol:</u></p> <ul> <li><strong>Volkswagen Golf 4</strong> - 1.4 16V, 1.6, 1.6 16V, 1.6FSI, 1.8, 1.8T, 1.8T GTI, 2.0, 2.3 V5, 1.9SDI, 1.9TDI</li> <li>Beleértve a Variant modellt</li> <li>Kivéve a 4-Motion változatot</li> <li>Első tengely terhelése: 1030kg</li> <li>Hátsó tengely terhelése: 1025kg</li> </ul> <p>Az állítható magasságú sport futómű a Volkswagen Golf 4-hez ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművek optimális összhangban vannak az Eibach gyártotta rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművek rugóit az Eibach gyártja</li> <li>Speciális Eibach rugók a maximális sportosság érdekében</li> <li>A Sport Series létrehozásakor a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li> <li>Gáztöltetű lengéscsillapítók</li> <li>Magas hatékonyság extrém igénybevétel mellett is</li> <li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> <li>Tökéletes összhang rugó és lengéscsillapító között</li> <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><u><strong>Termék karakterisztika:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p> <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 1M), kivéve 4-Motion, 1999.03-2004.10-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-1m-kiveve-4-motion-1999-03-2004-10-ig-sport-series-allithato-magassagu-futomu'),
(998, '', '<p>Ez az Állítható magasságú futómű kompatibilis a következő autótípussal:</p>\n<ul>\n	<li>Volkswagen Golf 4 Variant</li>\n	<li>Tipuskód: 1J</li>\n	<li>Kivéve 4-Motion</li>\n	<li>Évjárat: 1999.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 1020</li>\n	<li>Tengelyterhelés hátul (kg): 1080</li>\n	<li>Egyéb információk: A gyári méretű abroncs és felnikombináció esetén szükséges a nyomtávszélesítő felszerelése!<br /> Az 50 mm-nél nagyobb átmérőjű gömbfejjel rendelkező modelleknél javasolt a stabilizátorrúd cseréje! Ezzel javítani lehet a jobb oldali féltengely szabad mozgását a futómű cseréje után. Az alkatrészek cikkszáma Xenon fényszóró nélküli modellekhez: ZB50-017, Xenon fényszórós modellekhez: ZB50-017.</li>\n</ul>\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ülésmagasság elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> (A futómű minden esetben ennél nagyobb intervallumban állítható, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\n	<li>Plusz ülésmagasság lehetőség elöl: +45 mm, hátul: +5 mm</li>\n</ul>\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF82-002</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Seat Toledo (Typ: 1M), kivéve 4-Motion, 1999-2005-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-seat-toledo-typ-1m-kiveve-4-motion-1999-2005-ig-allithato-magassagu-futomu'),
(999, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a 1999-2005 között gyártott SEAT TOLEDO modellekhez készült. Ennek az egyedülálló futóműnek az előnye, hogy nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. A futómű beállítását az egyedi igények szerint 30-50/30-50 mm tartományban lehet végezni. A szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat is, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet biztosítanak. A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A futómű szett alapvetően 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve. Ne feledd, ez a termék Made in Germany!</p> <p>Cikkszám: 968537</p>', 'Vogtland Seat Toledo (Typ: 1M), kivéve 4-Motion, 1999-2005-ig állítható magasságú futómű', '', '', '', 'vogtland-seat-toledo-typ-1m-kiveve-4-motion-1999-2005-ig-allithato-magassagu-futomu'),
(1000, '', '<strong>Állítható magasságú futómű a Seat Toledo JOM BLUE LINE modellekhez</strong><br />\\r\\nTípuskód: 5P</p>\\r\\n\\r\\n<p>Az említett futóművet 1.9TDi DSG és 2.0TDi DSG motorokhoz tervezték, beleértve a FR verziót is.<br />\\r\\nAz érvényes évjáratok: 2004.10-2009.05<br />\\r\\nEz a futómű a hátsó tengelynél rendelkezik magasságállítóval, mely a rugó alatt található.<br />\\r\\nFontos tudni, hogy a futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), mely nem tartozéka ennek a szettnek!<br />\\r\\nAz elülső tengely terhelése: 1106-1200 kg<br />\\r\\nA hátsó tengely terhelése: 1250 kg<br />\\r\\nEz a termék MADE IN GERMANY<br />\\r\\nA futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.<br />\\r\\nA termék teljes körű, 2 éves garanciával érkezik!!!<br />\\r\\nKiemelkedő minőség, elképesztően jó áron!!!<br />\\r\\nA szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és 1 db állítókulccsal</p>\\r\\n', 'Jom Bochum Seat Toledo (Typ: 5P), 1.9TDi DSG, 2.0TDi DSG, beleértve FR, 2004.10-2009.05-ig, (első tengely terhelés 1106-1200kg), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-toledo-typ-5p-1-9tdi-dsg-2-0tdi-dsg-beleertve-fr-2004-10-2009-05-ig-els-tengely-terheles-1106-1200kg-blue-line-allithato-magassagu-futomu'),
(1001, '', '<strong>Seat Toledo JOM BLUE LINE változtatható magasságú futómû</strong><br />\\r\\nTípuskód: 5P</p>\\r\\n\\r\\n<p>Motor: 1.6, 2.0, 2.0T, 1.9TDi<br />\\r\\nGyártási időszak: 2004 októbere - 2009 májusáig<br />\\r\\nA hátsó tengelyen a magasságszabályozó a rugó alatt található.<br />\\r\\nFONTOS! Ennek a futóműnek a telepítéséhez rövidített stabilizátor rúdra van szükség (kutyacsont), amely nem szerepel ebben a szettben!<br />\\r\\nElülső tengelyterhelés: 1105 kg alatt<br />\\r\\nHátsó tengelyterhelés: 1250 kg<br />\\r\\nGYÁRTVA NÉMETORSZÁGBAN<br />\\r\\nEz a futómű rendelkezik német TÜV engedéllyel, amelyet a csomag tartalmaz.<br />\\r\\n2 ÉVES TELJESKÖRŰ GARANCIÁVAL!!!<br />\\r\\nKiemelkedő minőség, elképesztően kedvező áron!!!<br />\\r\\nA szett tartalma: 4 darab lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 darab kulccsal</p>\\r\\n', 'Jom Bochum Seat Toledo (Typ: 5P), 1.6, 2.0, 2.0T, 1.9TDi, 2004.10-2009.05-ig, (első tengely terhelés 1105kg alatt), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-seat-toledo-typ-5p-1-6-2-0-2-0t-1-9tdi-2004-10-2009-05-ig-els-tengely-terheles-1105kg-alatt-blue-line-allithato-magassagu-futomu'),
(1002, '', '<p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az versenyképes árakat. A futóművek magassága fokozatmentesen szabályozható, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes egyensúly van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Rugók a <strong>Eibach</strong> gyártásában</li>\n	<li>Magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Kiváló hatékonyság extrém igénybevételek során is</li>\n	<li>Dupla bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Rugók és lengéscsillapítók tökéletes harmóniája</li>\n	<li>Plug & Play készlet, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 5P), 2004.04-2009.05-ig, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-5p-2004-04-2009-05-ig-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu'),
(1003, '', '<strong>Állítható magasságú sport futómű az Audi A3-hoz MTS-Technik-től</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futómű magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  ', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 5P), 2004.04-2009.05-ig, (első tengely terhelés 1036-1170kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-5p-2004-04-2009-05-ig-els-tengely-terheles-1036-1170kg-street-series-allithato-magassagu-futomu'),
(1004, '', '<p>A <strong>MTS-Technik Sport sorozatú állítható magasságú sport futóművei</strong> ideális választás azok számára, akik nem akarnak kompromisszumot kötni. Az útviszonyoknak megfelelően állítható magasságú futóművek lehetővé teszik az autó hasmagasságának könnyed beállítását. Az <strong>MTS-Technik Sport futóművek</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n<p>Az alábbi típusokhoz ajánlott:</p>\n<ul>\n	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>\n	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>\n	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li>\n	<li>Első tengely terhelés: 1036-1170kg</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n	<li>Ültetés mértéke elöl: 35-70mm</li>\n	<li>Ültetés mértéke hátul: 35-60mm</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>a futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>\n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a fő cél</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 5P), 2004.04-2009.05-ig, (első tengely terhelés 1036-1170kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-5p-2004-04-2009-05-ig-els-tengely-terheles-1036-1170kg-sport-series-allithato-magassagu-futomu'),
(1005, '', '<p><strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futóművei</strong> ideális választás azok számára, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> optimális egyensúlyban vannak az <strong>Eibach gyártmányú rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. Széles ültetési tartomány és maximális vezetési élmény!</p>  <p>A következő modellekhez:</p>  <ul> 	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1035kg alatt</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elől: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>a <strong>Sport sorozat</strong> létrehozásakor a szélesebb ültetési tartomány és a fokozott vezetési élmény volt a fő szempont</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>  ', 'MTS-Technik by Nord Performance Seat Toledo (Typ: 5P), 2004.04-2009.05-ig, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-5p-2004-04-2009-05-ig-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(1006, '', '<p>A Vogtland állítható magasságú futómű szett egy olyan termék, amelyet a SEAT ALTEA autókhoz terveztek. Ez a futómű szett 2004-től az újabb évjáratú járművekhez használható. Az ültetés mértéke 20-50 mm között állítható, és a lengéscsillapító ház átmérője 55 mm. A maximális tengelyterhelés elöl legfeljebb 1060 kg, míg hátul 1150 kg lehet.</p>\n\n<p>Ez a futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. Az ültetés mértékét személyre szabottan állíthatja be. A készlet kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n\n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968235</p>', 'Vogtland Seat Toledo (Typ: P5), 2004.10-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-toledo-typ-p5-2004-10-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1007, '', '<p>A Vogtland állítható magasságú futómű szettet kifejezetten a SEAT ALTEA típusú autókhoz tervezték. Ez a futómű kitűnő lehetőséget nyújt arra, hogy az autó megjelenése mellett a vezetési élményt is maximalizálja. A futóművel könnyedén beállíthatja az ülésmagasságot az ön igényei szerint. A szett magas minőségű, kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme kiváló, így hosszú távon is megbízhatóak.</p>\n<p>Ez a termék TÜV minősítéssel rendelkezik, így biztos lehet benne, hogy megfelel a szigorú minőségi előírásoknak. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, így biztos lehet abban, hogy a Vogtland futómű szett kiváló minőségű és tartós. Ráadásul a gyártó 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. Mindezek mellett fontos kiemelni, hogy a termék Made in Germany minőséget képvisel. A cikkszám: 968234.</p>', 'Vogtland Seat Toledo (Typ: P5), 2004.10-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-seat-toledo-typ-p5-2004-10-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1008, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a Seat Altea típusú autókhoz, évjáratától függetlenül. Ezzel a futóművel 20-50 mm között állíthatod az autó ülésmagasságát, miközben maximális vezetési élményt biztosít. A futóműhöz speciális, nagy teljesítményű lengéscsillapítók tartoznak, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hosszú élettartamot biztosítanak.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak ellátva.</p>\n<p>A termék \"Made in Germany\" minőséget képvisel, és cikkszáma: 968236.</p>', 'Vogtland Seat Toledo (Typ 5P), beleértve FR, 1.9TDi DSG, 2.0TDi DSG, 2004.05-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-seat-toledo-typ-5p-beleertve-fr-1-9tdi-dsg-2-0tdi-dsg-2004-05-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1009, '', '<p>A Vogtland állítható magasságú futómű szettet kifejezetten a SEAT ALTEA modellekhez tervezték, melyek gyártási éve 2004-től kezdődik. Az ültetés mértéke 20-50 / 20-50 mm között állítható, és a típus a Seat Altea, Typ 5P, a lengéscsillapító ház átmérője pedig 55 mm. Az első tengelyterhelés maximuma (több mint 1060 kg esetén) 1170 kg, míg a hátsó tengelyterhelés maximális értéke 1150 kg.</p> \n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A beállításoknak köszönhetően személyre szabottan alakítható az autó ültetése. A minőségi futómű tartalmazza a kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, biztosítva ezzel az egyensúlyt a komfort és a dinamika között. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p> \n<p>A futómű szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p> \n<p>Made in Germany!</p> \n<p>Cikkszám: 968237</p>', 'Vogtland Seat Toledo (Typ: P5), 2004.10-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-seat-toledo-typ-p5-2004-10-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1010, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően, mivel fokozatmentesen állítható a magassága. Az MTS-Technik futóművei kiemelkedően jó összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja.</li>\n	<li>A magasság szinte minden esetben 25 és 80 mm között állítható.</li>\n	<li>A lengéscsillapítók gáztöltésűek.</li>\n	<li>Magas hatékonyság jellemzi őket extrém igénybevétel mellett is.</li>\n	<li>A hosszantartó korrózióvédelem érdekében két rétegű bevonattal rendelkeznek (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>A rugók és a lengéscsillapítók tökéletes egyensúlyban vannak egymással.</li>\n	<li>A készlet könnyen beépíthető, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Seat Toledo (Typ: KG3), 2012.07-2019.04-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-kg3-2012-07-2019-04-ig-street-series-allithato-magassagu-futomu'),
(1011, '', '<p><strong>MTS-Technik Sport Series rugókkal felszerelt sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport Series állítható futóművei</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> tökéletes egyensúlyt teremtenek az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>  <p><u>Ez a termék megfelelő az alábbi típusokhoz:</u></p>  <ul> 	<li><strong>Seat Toledo MK4 (Typ: KG3), </strong>1.0 TSI / 1.2 / 1.2 TSI / 1.4 TSI / 1.6 / 1.4 TDI / 1.6 TDI</li> 	<li>Elülső ültetés: 20-60mm</li> 	<li>Hátsó ültetés: 40-75mm</li> 	<li>Elülső tengely terhelés: 960kg</li> 	<li>Hátsó tengely terhelés: 910kg</li> 	<li>TÜV engedéllyel rendelkezik!</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az <strong>Eibach</strong> gyártja</li> 	<li><strong>Eibach rugók</strong> a maximális sportosságért</li> 	<li>A <strong>Sport Series</strong> létrehozásakor a fokozott vezetési élmény mellett a széles ültetési tartomány volt a cél</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelésnél is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel felfüggesztés-módosítást</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  <p> </p>  <p> </p>', 'MTS-Technik by Nord Performance Seat Toledo (Typ: KG3), 2012.07-2019.04-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-kg3-2012-07-2019-04-ig-sport-series-allithato-magassagu-futomu'),
(1012, '', '<strong>Seat Toledo MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  <p><u>A fenti modellhez ajánlott:</u></p>  <ul> 	<li><strong>Seat Toledo MK4 (Typ: KG3), </strong>1.0 TSI / 1.2 / 1.2 TSI / 1.4 TSI / 1.6 / 1.4 TDI / 1.6 TDI</li> 	<li>Elülső ültetés: 20-60mm</li> 	<li>Hátsó ültetés: 40-75mm</li> 	<li>Elülső tengely terhelhetőség: 960kg</li> 	<li>Hátsó tengely terhelhetőség: 910kg</li> 	<li>TÜV minősítéssel</li> </ul>  <p>Az <strong>MTS-Technik Comfort sorozatú állítható magasságú sport futómű</strong> tökéletes választás azoknak, akiknek fontos a sportos megjelenés és az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Comfort futóművei</strong> optimálisan kombinálják az <strong>Eibach</strong> rugókat és az <strong>MTS-Technik lengéscsillapítókat</strong>.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Különleges <strong>Eibach rugók</strong> a maximális kényelemért</li> 	<li>A <strong>Comfort sorozat</strong> célja a magas kényelem, nem az extrém ültetés</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes egyensúlya</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást a felfüggesztésben</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>Az írásos és képi tartalom másolása, reprodukálása engedély nélkül tilos!</em></p>  <p> </p>  <p> </p> ', 'MTS-Technik by Nord Performance Seat Toledo (Typ: KG3), 2012.07-2019.04-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-seat-toledo-typ-kg3-2012-07-2019-04-ig-comfort-series-allithato-magassagu-futomu'),
(1013, '', 'Ez a JOM Blueline Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>VW UP</li>\\r\\n	<li>Tipuskód: AA</li>\\r\\n	<li>Évjárat: 2011.12-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 680</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 640</li>\\r\\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, azonban a TÜV engedély kizárólag ezekre az beállításokra vonatkozik.)</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Skoda Citigo (Typ: AA), 2011.10-től állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-citigo-typ-aa-2011-10-tol-allithato-magassagu-futomu'),
(1014, '', '<strong>Állítható magasságú és keménységű futómű a Skoda Citigo V-Maxx számára</strong><br />\n<p>A Skoda Citigo V-Maxx futóműve 2011. októberétől elérhető.</p><br />\n<p>Az ültetés mértéke elől: 30-60mm, hátsó részen pedig 30-50mm.</p><br />\n<p>Fontos tudnivaló, hogy a futómű beszereléséhez rövidített stabilizátorrúd szükséges.</p><br />\n<p>A futómű TÜV engedélyezett, további információk a <a href=\\\"https://www.v-maxx.com/files/TUV/60%20VS%2014.pdf\\\">https://www.v-maxx.com/files/TUV/60%20VS%2014.pdf</a> weboldalon találhatók.</p>', 'V-Maxx Skoda Citigo (Typ: AA), 2011.10-től állítható magasságú futómű', '', '', '', 'v-maxx-skoda-citigo-typ-aa-2011-10-tol-allithato-magassagu-futomu'),
(1015, '', '<p>Ez az állítható magasságú futómű passzol a következő autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>VW UP</li>\\r\\n	<li>Tipuskód: AA</li>\\r\\n	<li>Évjárat: 2011.12-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 680</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 640</li>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható<br />\\r\\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +5 mm</li>\\r\\n	<li>Made In Ap-Fahrwerke Németország</li>\\r\\n	<li>Garancia erre a termékre: 2 év</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszáma: </strong>1158000C</p>\\r\\n\\r\\n<p><br />\\r\\nAz ár 1 szettre vonatkozik!</p>\\r\\n', 'AP made by KW Skoda Citigo (Typ: AA), 2011.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-citigo-typ-aa-2011-10-tol-allithato-magassagu-futomu'),
(1016, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: SKODA CITIGO</p>\n\n<p>Az 2011. októberétől gyártott Skoda Citigo típus AA-hoz tervezett Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt, miközben javítja az autó megjelenését. Az ültetés mértéke 30-60 mm között szabályozható, lehetővé téve a személyre szabott beállítást. A minőségi futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus vezetést biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók a tartósságot és megbízhatóságot garantálják.</p>\n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra, akik több mint 100 éves tapasztalattal rendelkeznek a rugógyártás terén. Az alapcsomag 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968732</p>', 'Vogtland Skoda Citigo (Typ: AA), 2011.10-től állítható magasságú futómű', '', '', '', 'vogtland-skoda-citigo-typ-aa-2011-10-tol-allithato-magassagu-futomu'),
(1017, '', '<strong>Állítható magasságú sport futómű a Skoda Fabia JOM BLUE LINE modellhez</strong><br />\\r\\nA Skoda Fabia JOM BLUE LINE típuskódja: 6Y<br />\\r\\nGyártási évek: 1999 - 2007<br />\\r\\nA sport futómű hátsó tengelyén a magasságállító a rugó alatt található.<br />\\r\\nFontos: Egyes modelleknél a futómű beszereléséhez rövidített stabilizátor rúdra (kutyacsont) van szükség, amely nem része ennek a szettnek!<br />\\r\\nAz első tengely teherbírása: 960 kg<br />\\r\\nA hátsó tengely teherbírása: 840 kg<br />\\r\\nKészült Németországban<br />\\r\\nEz a futómű rendelkezik német nyelvű TÜV engedéllyel, mely a csomagolás része.<br />\\r\\n2 ÉV teljeskörű garanciával!!!<br />\\r\\nMagas minőség, rendkívül kedvező áron!!!<br />\\r\\nA szett tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal és 2 db állítókulcsot.</p>\\r\\n', 'Jom Bochum Skoda Fabia (Typ: 6Y), 1999-2007-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-fabia-typ-6y-1999-2007-ig-blue-line-allithato-magassagu-futomu'),
(1018, '', '<div>\n  <strong>\n    <span style=\\\\\\\"box-sizing: border-box;\\\\\\\">Skoda Fabia</span>\n    <strong style=\\\\\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\\\\\"> </strong>V-Maxx magasságállítható sportfutómű</strong>\n</div>', 'V-Maxx Skoda Fabia (Typ: 6Y), 1999.12-2007.12-ig állítható magasságú futómű', '', '', '', 'v-maxx-skoda-fabia-typ-6y-1999-12-2007-12-ig-allithato-magassagu-futomu'),
(1019, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz, és optimalizálható az autó hasmagassága. A rugók és a lengéscsillapítók között tökéletes összhang van a MTS-Technik futóműveknél.</p> <p><u>Az alábbi típusokhoz kompatibilis:</u></p> <ul> <li><strong>Skoda Fabia, </strong>1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> <li>Elülső ültetés: 15-60mm</li> <li>Hátsó ültetés: 15-60mm</li> <li>Elülső tengely terhelés: 960kg</li> <li>Hátsó tengely terhelés: 840kg</li> </ul> <p><u>Termékjellemzők:</u></p> <ul> <li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> <li>A magasság szabadon állítható általában 25-80 mm között</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Kiemelkedő hatékonyság extrém igénybevétel esetén is</li> <li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> <li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><u><strong>Termék jellemzői:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Skoda Fabia (Typ: 6Y), 1999-2007-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-fabia-typ-6y-1999-2007-ig-street-series-allithato-magassagu-futomu'),
(1020, '', '<strong>MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futómű</strong> ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az <strong>MTS-Technik Sport állítható futóművei</strong> tökéletes harmóniát teremtenek az <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong>. Széles ültetési tartomány és maximális vezetési élmény!</p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Skoda Fabia</strong> 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li> 	<li>Elülső ültetés: 50-80mm</li> 	<li>Hátsó ültetés: 50-90mm</li> 	<li>Elülső tengely terhelés: 960kg</li> 	<li>Hátsó tengely terhelés: 840kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> sportos teljesítményért</li> 	<li>A <strong>Sport sorozat</strong> célja a széles ültetési tartomány mellett a fokozott vezetési élmény</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat hosszú élettartamért és korrózióvédelemért</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Skoda Fabia (Typ: 6Y), 1999-2007-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-fabia-typ-6y-1999-2007-ig-sport-series-allithato-magassagu-futomu'),
(1021, '', '<div>A Skoda Fabia V-Maxx sport futóműve lehetővé teszi a magasság és keménység állítását.</div>', 'V-Maxx Skoda Fabia (Typ: 6Y), 1999.12-2007.12-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-skoda-fabia-typ-6y-1999-12-2007-12-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1022, '', '<strong>Vogtland</strong> állítható magasságú futómû készlet: SKODA FABIA</p>  <ul> 	<li><strong>Évjárat</strong>: 2000.03-2007-ig</li> 	<li><strong>Ültetés mértéke</strong>: 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Skoda Fabia, Typ 6Y, Lim. / Sedan, Kombi / Station wagon</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 840 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. Ennek a minőségi futómű készletnek a részei speciális, nagy teljesítményű, kétcsöves lengéscsillapítók, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p>  <p>A készlet alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezőkkel vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968531</p> ', 'Vogtland Skoda Fabia (Typ: 6Y), Sedan és Kombi, 2000.03-2007-ig állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-6y-sedan-es-kombi-2000-03-2007-ig-allithato-magassagu-futomu'),
(1023, '', '<p>Az Ap futómű célja, hogy a sportosan ambiciózus vezetők számára lehetővé tegye a kívánt ültetés milliméteres pontossággal történő beállítását. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját nyújtjuk a maximális ültetéssel egyesítve.</p>\n\n<p>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű harmonizálása optimális felállást biztosít.</p>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>\n\n<p>Fontos! Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</p>', 'AP made by KW Skoda Fabia (Typ: 6Y), 2000.03-2007-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-fabia-typ-6y-2000-03-2007-ig-allithato-magassagu-futomu'),
(1024, '', '<p>Egy állítható magasságú sport futómű a Skoda Fabia JOM BLUE LINE számára, mely kompatibilis a 2007.04-2014 közötti években gyártott 5J típusú modellekhez. A rendelkezésre álló motorváltozatok között szerepel a 1.2 TSI, 1.2 TDI, 1.4, 1.4 TDI, 1.6, 1.6 TDI, 1.9TDI, valamint a 2.0TDI. Fontos megjegyzés, hogy a futómű beszereléséhez ajánlott a rövidített stabilizátor rúd (kutyacsont) használata, mely nem része ennek a szettnak. Az elülső tengelyterhelés 960 kg, míg a hátsó tengelyé 840 kg. Az alkatrész MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. A termékhez 2 év teljes körű garancia jár. A csomag tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot.</p>', 'Jom Bochum Skoda Fabia (Typ: 5J), beleértve Kombi, 2007.04-2014-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-fabia-typ-5j-beleertve-kombi-2007-04-2014-ig-blue-line-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1025, '', '<strong>Állítható rugózás lehetőségei a Skoda Fabia számára</strong><br /><ul><li>Modell: Skoda Fabia (Typ: 5J)</li><li>Gyártási időszak: 2009.01-2014.12</li><li>Különböző motorváltozatok: 1.0 / 1.0TSI / 1.2 / 1.2TSI / 1.4 / 1.4TSI / 1.6 / 1.8TSI / 1.4 TDi / 1.6TDi / 1.9TDi / 2.0 TDi</li><li>Alkalmas kombi modellekre is</li><li>Az ár nem tartalmazza a rövidített stabilizátorrudat a felszereléshez</li><li>Elülső ültetési tartomány: 35-70mm</li><li>Hátsó ültetési tartomány: 30-50mm</li><li>24 hónap garancia</li><li>A termék TÜV engedéllyel rendelkezik</li></ul><br /><p>Szerelési útmutató elérhető itt: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf</a></p><br /><p>TÜV engedély részletei: <a href=\\\"https://www.v-maxx.com/files/TUV/60%20VS%2013.pdf\\\">https://www.v-maxx.com/files/TUV/60%20VS%2013.pdf</a></p>', 'V-Maxx Skoda Fabia (Typ: 5J), beleértve Kombi, 2009.01-2014.12-ig állítható magasságú futómű', '', '', '', 'v-maxx-skoda-fabia-typ-5j-beleertve-kombi-2009-01-2014-12-ig-allithato-magassagu-futomu'),
(1026, '', '<p>Az MTS-Technik Comfort Series állítható magasságú sport futóműve tökéletes választás azoknak, akik szeretnének sportosabb megjelenést és jobb utazási kényelmet az autójukban. A futómű fokozatmentesen állítható magassága könnyen igazítható az útviszonyokhoz, így biztosítva az optimális hasmagasságot. Az Eibach rugók és az MTS-Technik lengéscsillapítók tökéletes összhangban vannak egymással, biztosítva a maximális kényelmet és teljesítményt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort Series hangsúlyt fektet a magas komfortra</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú élettartam érdekében</li>\n	<li>Tökéletes összhang rugók és lengéscsillapítók között</li>\n	<li>Plug & Play kivitel, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Skoda Fabia (Typ: 5J), beleértve Kombi, 2009.01-2014.12-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-fabia-typ-5j-beleertve-kombi-2009-01-2014-12-ig-comfort-series-allithato-magassagu-futomu'),
(1027, '', '<p>Az MTS-Technik által készített állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat! Az autó hasmagassága könnyedén állítható a változó útviszonyoknak megfelelően, mivel a futómű fokozatmentesen szabályozható. Az MTS-Technik futóművek kimagasló összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach gyártja</li>\n	<li>A magasság állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem szükséges módosítás az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Fabia (Typ: 5J), beleértve Kombi, 2009.01-2014.12-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-fabia-typ-5j-beleertve-kombi-2009-01-2014-12-ig-allithato-magassagu-futomu'),
(1028, '', '<div><span>Az Ap futómû lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméterre precízen beállítsák a kívánt üléspozíciót. Az optimális vezetési magatartás és a sportos irányíthatóság kombinációját nyújtjuk, maximális ültetéssel összekötve.</span></div> <div><span>Egy alumínium rugótányér segítségével személyre szabható a járműmagasság a TÜV által engedélyezett tartományon belül. A sportosság, a kényelem és a biztonság tökéletes összehangolásával optimális felépítést biztosítunk.</span></div> <ul>     <li><span>kiváló minőségű termékek elérhető áron</span></li>     <li><span>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kivételes ár-érték arány</span></li>     <li><span>német minőségű gyártás</span></li> </ul>', 'AP made by KW Skoda Fabia (Typ: 5J), 2007.04-2008.12-ig, (első tengely terhelés 890kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-fabia-typ-5j-2007-04-2008-12-ig-els-tengely-terheles-890kg-alatt-allithato-magassagu-futomu'),
(1029, '', '<div><span>Az Ap futómű kiváló lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy a kívánt ültetést milliméter pontosan beállítsák. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját nyújtjuk, maximalizálva ezzel az ültetés élményét.</span></div> <div><span>A járműmagasság egyedi beállítására lehetőség van egy alumínium rugótányér segítségével, amely a TÜV által engedélyezett tartományban mozgatható. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felhasználói élményt biztosít.</span></div> <ul>     <li><span>Kiváló minőségű termékek elérhető áron</span></li>     <li><span>Egyedi magasságbeállítás TÜV engedélyezett tartományban</span></li>     <li><span>Kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kivételes ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Skoda Fabia (Typ: 5J), 2007.04-2008.12-ig, (első tengely terhelés 891-960kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-fabia-typ-5j-2007-04-2008-12-ig-els-tengely-terheles-891-960kg-allithato-magassagu-futomu'),
(1030, '', '<div><div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák az általuk kívánt üléspozíciót. A sportos irányíthatóság és optimális vezetési élmény kombinációját nyújtjuk, maximális ültetéssel összekapcsolva.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetséges a jármű magasságának egyéni beállítása a TÜV által engedélyezett tartományban belül. A sportosság, kényelem és biztonság harmóniájának összehangolása optimális felépítést eredményez.</span></div> <ul> <li><span>kiváló minőség elérhető áron</span></li> <li><span>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</span></li> <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li> <li><span>kivételes ár/érték arány</span></li> <li><span>német minőség</span></li> </ul> </div>', 'AP made by KW Skoda Fabia (Typ: 5J), 2009.01-től, (első tengely terhelés 925kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-fabia-typ-5j-2009-01-tol-els-tengely-terheles-925kg-alatt-allithato-magassagu-futomu'),
(1031, '', '<div><span>Az Ap futómû lehetőséget biztosít a sportosan ambiciózus vezetőnek arra, hogy milliméter pontossággal beállítsa az általa kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</span></div> <div><span>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosságot, kényelmet és biztonságot párhuzamosan összehangoljuk, hogy optimális felépítést érjünk el.</span></div> <ul>     <li><span>kiváló minőségű termék megfizethető áron</span></li>     <li><span>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kivételes ár/érték arány</span></li>     <li><span>német minőség</span></li> </ul>', 'AP made by KW Skoda Fabia (Typ: 5J), 2009.01-től, (első tengely terhelés 926-960kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-fabia-typ-5j-2009-01-tol-els-tengely-terheles-926-960kg-allithato-magassagu-futomu'),
(1032, '', '<strong>Állítható magasságú és keménységű futómű a Skoda Fabia-hoz</strong><br /><br /><ul><br /><li>Típus: Skoda Fabia (Typ: 5J)</li><br /><li>Évjárat: 2009.01-2014.12-ig</li><br /><li>Motor: 1.0 / 1.0TSI / 1.2 / 1.2TSI / 1.4 / 1.4TSI / 1.6 / 1.8TSI / 1.4 TDi / 1.6TDi / 1.9TDi / 2.0 TDi</li><br /><li>Beleértve Kombi</li><br /><li>20 fokozatban változtatható merevség</li><br /><li>A felszereléshez rövidített stabilizátorrúd szükséges, mely nem található a csomagolásban</li><br /><li>Elülső ülésmagasság beállítása: 35-70mm</li><br /><li>Hátsó ülésmagasság beállítása: 30-50mm</li><br /><li>24 hónapos garanciával</li><br /><li>Az alkatrész rendelkezik TÜV engedéllyel</li><br /></ul><br /><br />További információk a <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\\\">szerelési útmutatóban</a><br />TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf\\\">itt</a> található.', 'V-Maxx Skoda Fabia (Typ: 5J), beleértve Kombi, 2009.01-2014.12-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-skoda-fabia-typ-5j-beleertve-kombi-2009-01-2014-12-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1033, '', '<div>\n<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy precízen beállítsa a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást maximális ültetéssel ötvözzük.</div>\n\n<div>Egy alumínium rugótányér segítségével a járműmagasság egyénileg beállítható a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot egyidejűleg biztosítjuk az optimális felépítés révén.</div>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>\n</div>', 'AP made by KW Skoda Fabia (Typ: 5J), 2014.11-től, (első tengely terhelés 910kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-fabia-typ-5j-2014-11-tol-els-tengely-terheles-910kg-alatt-allithato-magassagu-futomu'),
(1034, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: SKODA FABIA</p>  <ul> 	<li><strong>Évjárat</strong>: 2007.04-2008.12</li> 	<li><strong>Ültetés mértéke</strong>: 25 - 55 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Skoda Fabia, Typ 5J, Lim. / Sedan, Kombi / Station wagon</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 890 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 840 kg</li> </ul>  <p>Az autó megjelenésén javítva maximális vezetési élményt nyújt. Az ültetés mértékét saját elképzelésének megfelelően állíthatja. A futómű szett kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel ellátottak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, melyekhez szintezős vagy torziós futóművet szereltek.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968080</p> ', 'Vogtland Skoda Fabia (Typ: 5J), 2007.04-2008.12-ig, (első tengely terhelés 890kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-5j-2007-04-2008-12-ig-els-tengely-terheles-890kg-alatt-allithato-magassagu-futomu'),
(1035, '', '<p><strong>Vogtland</strong><span> állítható futómű szett</span>: VOLKSWAGEN POLO 6R</p>  \n<ul> 	\n<li><strong>Évjárat</strong>: 2009.05-től</li> 	\n<li><strong>Ültetés mértéke:</strong> 30 - 60 / 25 - 50 mm</li> 	\n<li><strong>Típus</strong>: Volkswagen Polo, Typ 6R</li> 	\n<li><strong>Max. tengelyterhelés elülső részen</strong>: 860 kg</li> 	\n<li><strong>Max. tengelyterhelés hátsó részen</strong>: 820 kg</li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett a termék optimális vezetési élményt kínál. Az ültetés mértékét az egyéni igényeknek megfelelően lehet beállítani. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek a alacsony nyomású gázrendszer révén biztosítják a kiegyensúlyozott kényelmet és a fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  \n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p>  \n<p>Made in Germany!</p>  \n<p>Cikkszám: 968089</p>', 'Vogtland Skoda Fabia (Typ: 5J), 2014.11-től, (első tengely terhelés 910kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-5j-2014-11-tol-els-tengely-terheles-910kg-alatt-allithato-magassagu-futomu'),
(1036, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SKODA FABIA</span></div>  \n<ul>\n	<li><strong>Évjárat</strong>: 2010.08-tól</li>\n	<li><strong>Ültetés mértéke</strong>: 15 - 45 / 15 - 40 mm</li>\n	<li><strong>Típus</strong>: Skoda Fabia RS, Typ 5J</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 840 kg</li>\n	<li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómû szett maximális vezetési élményt nyújt. Lehetőség van az ültetés mértékének személyre szabott beállítására. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak a alacsony nyomású gázrendszernek köszönhetően. Az első osztályú korrózióvédelemmel rendelkező lengéscsillapítók biztosítják a minőséget.</p>\n<p>A Vogtland futómű TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futómű van beépítve.</p>\n<p>Készült Németországban!</p>\n<p>Cikkszám: 968132</p>', 'Vogtland Skoda Fabia (Typ: 5J) RS, 2010.08-tól, (első tengely terhelés 960kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-5j-rs-2010-08-tol-els-tengely-terheles-960kg-alatt-allithato-magassagu-futomu'),
(1037, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: SKODA FABIA</span></div>\n<ul>\n	<li><strong>Évjárat</strong>: 2009.01-2014.10-ig</li>\n	<li><strong>Ültetés mértéke</strong>: 25 - 55 / 30 - 55 mm</li>\n	<li><strong>Típus</strong>: Skoda Fabia, Typ 5J, Lim. / Sedan, Kombi / Station wagon</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 960 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 840 kg</li>\n	<li> </li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az ültetés mértéke szabadon beállítható a megfelelő értékek között, szem előtt tartva saját elképzeléseit. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelme első osztályú.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968130</p>', 'Vogtland Skoda Fabia (Typ: 5J), 2009.01-2014.10-ig, (első tengely terhelés 926-960kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-5j-2009-01-2014-10-ig-els-tengely-terheles-926-960kg-allithato-magassagu-futomu'),
(1038, '', '<p><strong>Vogtland</strong><span> által készített állítható magasságú futómű szett:</span> SKODA FABIA</p>\n<ul>\n	<li><strong>Gyártási év</strong>: 2007.04-2008.12</li>\n	<li><strong>Ültetés mértéke</strong>: 25 - 55 / 25 - 50 mm</li>\n	<li><strong>Típus</strong>: Skoda Fabia, Typ 5J, Lim. / Sedan, Kombi / Station wagon</li>\n	<li><strong>Elülső tengely maximális terhelése</strong>: 960 kg</li>\n	<li><strong>Hátsó tengely maximális terhelése</strong>: 840 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximalizálja a vezetési élményt. Az ültetés mértékét az egyéni igények szerint állíthatja be. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók első osztályú korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A futómű szett alapvetően 4 db ültetőrugóból és 4 db lengéscsillapítóból áll, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet szereltek fel.</p>\n<p>Magyarországon készült!</p>\n<p>Cikkszám: 968081</p>', 'Vogtland Skoda Fabia (Typ: 5J), 2007.04-2008.12-ig, (első tengely terhelés 891-960kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-5j-2007-04-2008-12-ig-els-tengely-terheles-891-960kg-allithato-magassagu-futomu'),
(1039, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SKODA FABIA</span></div>  <ul> 	<li><strong>Évjárat</strong>: 2009.01-2014.10-ig</li> 	<li><strong>Ültetés mértéke</strong>: 25 - 55 / 30 - 55 mm</li> 	<li><strong>Típus</strong>: Skoda Fabia, Typ 5J, Lim. / Sedan, Kombi / Station wagon</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 925 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 840 kg</li> </ul>  <p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is fokozza. A szett lehetőséget biztosít az ültetés mértékének személyre szabott beállítására. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így optimális komfortot és dinamikus vezetést garantálnak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugók területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártási hely: Németország!</p>  <p>Cikkszám: 968128</p> ', 'Vogtland Skoda Fabia (Typ: 5J), 2009.01-2014.10-ig, (első tengely terhelés 925kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-fabia-typ-5j-2009-01-2014-10-ig-els-tengely-terheles-925kg-alatt-allithato-magassagu-futomu'),
(1040, '', '<strong>Állítható magasságú futómű a legújabb Skoda Fabia modellhez</strong><br /><ul><li>Típus: Új Skoda Fabia (Typ: NJ)</li><li>Évjárat: 2014.08-tól</li><li>Motor: Különböző motorváltozatok</li><li>Alkalmazható Kombi változathoz</li><li>Nem kompatibilis a 4x4 változattal</li><li>A beépítéshez szükséges rövidített stabilizátorrúd nem tartozék</li><li>Elülső ültetés csökkentése: 35-70mm</li><li>Hátsó ültetés csökkentése: 30-50mm</li><li>24 hónapos garancia</li><li>A futómű TÜV engedéllyel rendelkezik</li></ul><br /><p>Telepítési útmutató: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf</a></p><br /><p>TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/60%20VS%2013.pdf\\\">https://www.v-maxx.com/files/TUV/60%20VS%2013.pdf</a></p>', 'V-Maxx Skoda Fabia (Typ: NJ), beleértve Kombi, 2014.08-tól állítható magasságú futómű', '', '', '', 'v-maxx-skoda-fabia-typ-nj-beleertve-kombi-2014-08-tol-allithato-magassagu-futomu'),
(1041, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p> <p>A MTS-Technik által kínált állítható magasságú sport futóművek ideális választás lehetnek azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li> <li>a magasság legtöbb esetben 25 és 80 mm között változtatható</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém igénybevételek esetén is</li> <li>dupla rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> <li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Skoda Fabia (Typ: NJ), beleértve Kombi, 2014.08-tól állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-fabia-typ-nj-beleertve-kombi-2014-08-tol-allithato-magassagu-futomu'),
(1042, '', '<p>Egy olyan futómű, amelyet kifejezetten azoknak ajánlanak, akik fontosnak tartják az utazási kényelmet és a sportos megjelenést. Ez a MTS-Technik Comfort Series futómű fokozatmentesen állítható magassággal rendelkezik, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az Eibach által gyártott rugók és az MTS-Technik lengéscsillapítók optimális egyensúlyt biztosítanak ebben a futóműben.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li> <li>speciális Eibach rugók a maximális kényelem érdekében</li> <li>a Comfort Series létrehozása során nem az extrém ültetés, hanem a magas kényelem volt a cél</li> <li>gáztöltéses lengéscsillapítók</li> <li>magas hatékonyság extrém igénybevétel mellett is</li> <li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> <li>tökéletes összehang rugó és lengéscsillapító között</li> <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Fabia (Typ: NJ), beleértve Kombi, 2014.08-tól, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-fabia-typ-nj-beleertve-kombi-2014-08-tol-comfort-series-allithato-magassagu-futomu'),
(1043, '', '<strong>Állítható magasságú és keménységű futómű a Skoda Fabia típushoz</strong><br /><ul><br /><li>Skoda Fabia (Typ: NJ) típus</li><br /><li>Gyártási év: 2014.08-tól</li><br /><li>Különböző motorváltozatokkal</li><br /><li>Kombi verzió is elérhető</li><br /><li>Nem rendelkezik Négykerék-hajtással</li><br /><li>Keménység szabályozható 20 fokozatban</li><br /><li>Rövidített stabilizátorrúd szükséges a beszereléshez (nem tartalmazza az ár)</li><br /><li>Elülső ültetés mértéke: 35-70mm</li><br /><li>Hátsó ültetés mértéke: 30-50mm</li><br /><li>24 hónapos garancia</li><br /><li>TÜV engedéllyel rendelkezik</li><br /></ul><br /><p>Telepítési útmutató letölthető innen: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf</a></p><br /><p>TÜV engedély elérhető itt: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf\\\">https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf</a></p>', 'V-Maxx Skoda Fabia (Typ: NJ), beleértve Kombi, 2014.08-tól, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-skoda-fabia-typ-nj-beleertve-kombi-2014-08-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(1044, '', '<p>Az MTS-Technik által kifejlesztett sport futóművek ideális választás azok számára, akik értékelik a kiváló minőséget és megfizethető árat. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodj az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát garantálják.</p>\n\n<u>A futómű passzol az alábbi típusokhoz:</u>\n\n<ul>\n	<li>Volkswagen Tiguan (Typ: AD1, AX1), 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1060kg</li>\n	<li>Hátsó tengely terhelés: 1390kg</li>\n	<li>Rugó erősség (első, fő rugó): 40 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 55 N/mm</li>\n	<li>A termék jelenleg nincs TÜV engedéllyel ellátva, az engedélyezés folyamatban van.</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<u><strong>Termék jellemzői:</strong></u>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Karoq, 1.0TSi, 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi, 2017.07-től, (első tengely terhelés 1020kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-karoq-1-0tsi-1-4tsi-1-5tsi-1-6tdi-2-0tdi-2017-07-tol-els-tengely-terheles-1020kg-alatt-street-series-allithato-magassagu-futomu'),
(1045, '', '<strong>Volkswagen Tiguan MTS-Technik Street állítható magasságú sport futómű</strong></p>\n<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság könnyedén szabályozható az útviszonyoknak megfelelően, biztosítva ezzel az optimális hasmagasságot. Az MTS-Technik futóműveiben tökéletes összhang van a rugók és a lengéscsillapítók között.</p>\n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>\n<ul>\n<li><strong>Volkswagen Tiguan (Typ: AD1, AX1)</strong> egyes változataihoz, mint például a 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n<li>Elülső ülésmélység: 35-55mm</li>\n<li>Hátsó ülésmélység: 30-55mm</li>\n<li>Elülső tengely terhelése: 1101-1240kg</li>\n<li>Hátsó tengely terhelése: 1400kg</li>\n<li>Elülső főrugó keménysége: 45 N/mm</li>\n<li>Hátsó főrugó keménysége: 60 N/mm</li>\n<li>Nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\n<li>Gáztöltésű lengéscsillapítók</li>\n<li>Magas hatékonyság extrém terhelés mellett is</li>\n<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében</li>\n<li>Rugók és lengéscsillapítók tökéletes összehangolása</li>\n<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek jogtalan másolása és terjesztése tilos!</em></p>\n<p> </p>\n<p> </p>', 'MTS-Technik by Nord Performance Skoda Karoq, 1.5TSi 4x4, 2.0TSi 4x4, 2.0TDi 4x4, 2017.07-től, (első tengely terhelés 1101-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-karoq-1-5tsi-4x4-2-0tsi-4x4-2-0tdi-4x4-2017-07-tol-els-tengely-terheles-1101-1240kg-street-series-allithato-magassagu-futomu'),
(1046, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az kedvező ár-érték arányt. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy az autó hasmagassága könnyedén igazítható legyen az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>\n\n<p><u>A következő típusokhoz passzol:</u></p>\n\n<ul>\n	<li>Volkswagen Tiguan (Typ: AD1, AX1), 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1061-1190kg</li>\n	<li>Hátsó tengely terhelés: 1390kg</li>\n	<li>Rugó erősség (elülső, fő rugó): 45 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 55 N/mm</li>\n	<li>TÜV engedéllyel nem rendelkezik! Engedélyezése folyamatban!</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzők:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\n\n<p> </p>\n\n<p> </p>', 'MTS-Technik by Nord Performance Skoda Karoq, 1.0TSi, 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi, 2017.07-től, (első tengely terhelés 1021-1190kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-karoq-1-0tsi-1-4tsi-1-5tsi-1-6tdi-2-0tdi-2017-07-tol-els-tengely-terheles-1021-1190kg-street-series-allithato-magassagu-futomu'),
(1047, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az megfizethető árat. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyára épülnek.</p>\n\n<p><u>Alábbi típusokhoz kompatibilis:</u></p>\n\n<ul>\n	<li>Volkswagen Tiguan (Typ: AD1, AX1), 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1100kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Rugó erősség (első, fő rugó): 40 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>A termék jelenleg nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van.</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><u><strong>Termék jellemzők:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek jogtalan másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Kodiaq, 1.4TSi 4x4, 1.5TSi 4x4, 2.0TSi 4x4, 2.0RS 4x4, 2.0TDi 4x4, 2.0RS Bi-TDi 4x4, 2016.10-től, (első tengely terhelés 1100kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-kodiaq-1-4tsi-4x4-1-5tsi-4x4-2-0tsi-4x4-2-0rs-4x4-2-0tdi-4x4-2-0rs-bi-tdi-4x4-2016-10-tol-els-tengely-terheles-1100kg-alatt-street-series-allithato-magas'),
(1048, '', '<p>Egy olyan autófutómű, amely fokozatmentesen állítható magassággal rendelkezik, ideális választás lehet azok számára, akik számára fontos a minőség és az ár. Az MTS-Technik futóműveinek köszönhetően könnyedén beállítható a jármű hasmagassága az útviszonyoknak megfelelően. Az optimális összhang a rugók és a lengéscsillapítók között biztosítja a kiváló teljesítményt.</p>\n\n<p><u>A futómű az alábbi típusokhoz passzol:</u></p>\n\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1), </strong>1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Elülső ültetés mértéke: 35-55mm</li>\n	<li>Hátsó ültetés mértéke: 30-55mm</li>\n	<li>Elülső tengely terhelés: 1101-1240kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Rugó erősség (elülső, fő rugó): 45 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyezés folyamatban van</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelésnél is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel autófelfüggesztés módosítást</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Kodiaq, 1.4TSi 4x4, 1.5TSi 4x4, 2.0TSi 4x4, 2.0RS 4x4, 2.0TDi 4x4, 2.0RS Bi-TDi 4x4, 2016.10-től, (első tengely terhelés 1101-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-p