hnik-by-nord-performance-skoda-kodiaq-1-4tsi-1-5tsi-2-0tdi-2016-10-tol-els-tengely-terheles-1060kg-alatt-street-series-allithato-magassagu-futomu'),
(1050, '', '<p>Egy olyan állítható magasságú sport futómű, amely ideális választás azok számára, akik számára fontos a minőség és az ár. A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<u>A következő típushoz illik:</u>\n\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1),</strong> 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\n	<li>Elülső ültetés: 35-55mm</li>\n	<li>Hátsó ültetés: 30-55mm</li>\n	<li>Elülső tengely terhelés: 1061-1190kg</li>\n	<li>Hátsó tengely terhelés: 1390kg</li>\n	<li>Rugó erősség (elülső, fő rugó): 45 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 55 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyezés folyamatban van</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék jellemzői:</strong></u>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Kodiaq, 1.4TSi, 1.5TSi, 2.0TDi, 2016.10-től, (első tengely terhelés 1061-1190kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-kodiaq-1-4tsi-1-5tsi-2-0tdi-2016-10-tol-els-tengely-terheles-1061-1190kg-street-series-allithato-magassagu-futomu'),
(1051, '', 'Ez a termék alkalmas a Skoda Octavia autóra, típuskód: 1U, gyártási évek: 1997 - 2004, kivéve RS és 4x4 változatok. Fontos, hogy a futómű beszereléséhez szükséges egy rövidített stabilizátor rúd, amely nem része ennek a szettnek! Az első tengelyterhelés 1020 kg, míg a hátsó tengelyterhelés 1025 kg. A futómű MADE IN GERMANY, és rendelkezik TÜV engedéllyel, melyet a csomagolás tartalmaz. 2 ÉV TELJESKÖRŰ GARANCIÁVAL! Kiváló minőségű termék, rendkívül kedvező áron! A szett tartalmazza: 4db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1db állítókulcsot.', 'Jom Bochum Skoda Octavia (Typ: 1U), kivéve RS és 4x4, 1997-2004-ig állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-1u-kiveve-rs-es-4x4-1997-2004-ig-allithato-magassagu-futomu'),
(1052, '', 'Az alkatrész kompatibilis a Skoda Octavia RS típusú autóval. A típuskódja 1U, és az évjárata 2001.05-től. Fontos megjegyezni, hogy kivéve a 4x4 változatot. A futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem tartozék a szetthez. Az autó tengelyterhelése elöl 1030 kg, míg hátul 845 kg. Ez a futómű MADE IN GERMANY, és rendelkezik TÜV engedéllyel, amely a csomagolás része. Emellett 2 év teljes körű garanciával rendelkezik. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot. A termék kiváló minőségű és rendkívül jó áron kapható.', 'Jom Bochum Skoda Octavia (Typ: 1U) RS, kivéve 4x4, 2001.05-től állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-1u-rs-kiveve-4x4-2001-05-tol-allithato-magassagu-futomu'),
(1053, '', '<strong>Skoda Octavia 4x4 JOM Blueline állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Skoda Octavia (1U típus), kizárólag 4x4</li>\\r\\n	<li>Évjárat: 1997-2003.12-ig</li>\\r\\n	<li>Elülső tengelyterhelés: 1050 kg</li>\\r\\n	<li>Hátsó tengelyterhelés: 1080 kg</li>\\r\\n	<li>Készült NÉMETORSZÁGBAN</li>\\r\\n	<li>A futómű rendelkezik német nyelvű TÜV engedéllyel</li>\\r\\n	<li>1 ÉV TELJES GARANCIÁVAL!!!</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\\r\\n	<li>A csomag tartalma: 4 darab lengéscsillapító, hozzá tartozó rugókkal és 1 darab állítókulccsal</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Skoda Octavia (Typ: 1U) 4x4, 1997-2003.12-ig állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-1u-4x4-1997-2003-12-ig-allithato-magassagu-futomu'),
(1054, '', '<strong>Felhúzható sport futómű Skoda Octavia (Típus: 1U) modellekhez</strong></p><br /><p>Nem kompatibilis: olyan változatok, amelyek összkerékhajtással rendelkeznek vagy RS változatok</p><br /><p>Elöl az ülés magassága 35 és 65 mm között állítható, míg hátul 30 és 60 mm között</p><br /><p>Ez a termék rendelkezik TÜV tanúsítvánnyal!</p>', 'V-Maxx Skoda Octavia (Typ: 1U), kivéve 4x4, 1997-2010-ig állítható magasságú futómű', '', '', '', 'v-maxx-skoda-octavia-typ-1u-kiveve-4x4-1997-2010-ig-allithato-magassagu-futomu'),
(1055, '', '<p>Az MTS-Technik által gyártott sport futóművek ideális választás azoknak, akik számára fontos a minőség és az ár. A futómű könnyedén állítható a különböző útviszonyokhoz igazodva, és tökéletes egyensúlyt teremt a rugók és a lengéscsillapítók között.</p>\n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>\n<ul>\n	<li>Volkswagen Golf 4, 1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li>\n	<li>Variant modellek</li>\n	<li>Kivéve 4-Motion</li>\n	<li>Első tengely terhelés: 1030kg</li>\n	<li>Hátsó tengely terhelés: 1025kg</li>\n	<li>Letölthető dokumentumok: <a href=\"https://mtstechnik.com/data/links/942261f61a7612a96ca82867b671968b/27089_4806.pdf\">TÜV engedély</a>, <a href=\"https://mtstechnik.com/data/links/29e8d2792cc0fe0725a1dd9df0d10bef/27089_4805.pdf\">szerelési útmutató</a></li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú élettartam érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1U), kivéve 4x4, 1997-2004-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1u-kiveve-4x4-1997-2004-ig-street-series-allithato-magassagu-futomu'),
(1056, '', '<p>A Volkswagen Golf 4-hez kompatibilis MTS-Technik Comfort állítható magasságú sport futómű tökéletes választás azok számára, akik fontosnak tartják az utazási kényelmet és a sportos megjelenést. A futómű rugóit az Eibach gyártja, biztosítva ezzel a maximális kényelmet. Az MTS-Technik Comfort futóművei nem csak esztétikailag vonzóak, de fokozatmentesen állítható magasságuknak köszönhetően könnyedén igazíthatók az útviszonyokhoz. A gáztöltésű lengéscsillapítók magas hatékonyságot biztosítanak extrém körülmények között is. A kiváló minőségű futóműveknek köszönhetően optimális az összhang a rugók és a lengéscsillapítók között, így garantálva a magas kényelmet és teljesítményt. A futóművek plug & play kivitelezése nem igényel módosítást az autó felfüggesztésében.</p><p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p><p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1U), kivéve 4x4, 1997-2004-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1u-kiveve-4x4-1997-2004-ig-comfort-series-allithato-magassagu-futomu'),
(1057, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az előnyös ár-érték arányt. A magasság fokozatmentesen állítható, lehetővé téve a könnyed beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimalizált az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Főbb jellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach vállalat gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében, sárga cink bevonat és fekete anodyzált alumínium alkatrészek</li> 	<li>Rugó és lengéscsillapító tökéletes egyensúlya</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul> ', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1U) 4x4, 1999.11-2004.02-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1u-4x4-1999-11-2004-02-ig-allithato-magassagu-futomu'),
(1058, '', '<strong>Állítható magasságú sport futómű Skoda Octavia RS és VRS típusokhoz</strong>\\n<p>A futómű beállítása elöl 35-60 mm között, míg hátul 30-50 mm között változtatható.</p>\\n<p>Ez a speciális alkatrész rendelkezik TÜV által kiadott engedéllyel.</p>', 'V-Maxx Skoda Octavia RS, VRS (Typ: 1U), 1997-2004-ig állítható magasságú futómű', '', '', '', 'v-maxx-skoda-octavia-rs-vrs-typ-1u-1997-2004-ig-allithato-magassagu-futomu'),
(1059, '', '<p><em>Állítható magasságú V-Maxx sport futómű a Skoda Octavia (Típus: 1U) modellekhez</em></p>\nCsak a négykerékhajtású változatokhoz ajánlott!\nElülső ültetési tartomány: 35 - 60 mm\nHátsó ültetési tartomány: 30 - 50 mm\nA termék TÜV jóváhagyással rendelkezik!', 'V-Maxx Skoda Octavia (Typ: 1U), csak 4x4, 1999-2004-ig állítható magasságú futómű', '', '', '', 'v-maxx-skoda-octavia-typ-1u-csak-4x4-1999-2004-ig-allithato-magassagu-futomu'),
(1060, '', '<p><strong>A Volkswagen Golf 4 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p><u>Az alábbi típusokhoz ajánlott:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Beleértve Variant</li> 	<li>Kivéve 4-Motion</li> 	<li>Első tengely terhelés: 1030kg</li> 	<li>Hátsó tengely terhelés: 1025kg</li> </ul>  <p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> kiváló választás azoknak, akik szeretnének kompromisszumok nélkül autózni! Az <strong>MTS-Technik Sport állítható futómű</strong> lehetővé teszi a magasság fokozatmentes állítását az útviszonyoknak megfelelően. Az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> optimális együttműködése a maximális vezetési élményt nyújtja széles ültetési tartománnyal!</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a legnagyobb sportteljesítményért</li> 	<li>A <strong>Sport Series</strong> létrehozásakor a fokozott vezetési élmény mellett a szélesebb ültetési tartomány volt a fókuszban</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Kettős bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1U), kivéve 4x4, 1997-2004-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1u-kiveve-4x4-1997-2004-ig-sport-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1061, '', '<strong>Skoda Octavia (Typ: 1U) V-Maxx állítható magasságú sport futómű</strong></p><br /><p>Ez a futómű 20 különböző keménységi szinttel rendelkezik.</p><br /><p>Kivételt képeznek a 4x4 és RS modellek.</p><br /><p>Az elülső üléspozíció csökkenthető 35-65 mm-rel, míg a hátsó üléspozíció 30-60 mm-rel.</p><br /><p>A termék TÜV engedéllyel rendelkezik.</p>', 'V-Maxx Skoda Octavia (Typ: 1U), kivéve 4x4, 1997-2010-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-skoda-octavia-typ-1u-kiveve-4x4-1997-2010-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1062, '', '<p>Ez az állítható magasságú futómű megfelel a Volkswagen Golf 4 Variant autótípusnak, kivéve a 4-Motion modelleket, melyekhez 1999.05-től használható. Az elülső tengelyterhelés 1020 kg, míg a hátsó tengelyterhelés 1080 kg. Fontos tudni, hogy a gyári méretű gumiabroncsok és felnik esetén nyomtávszélesítő felszerelése szükséges. Az 50 mm-nél nagyobb átmérőjű feltengellyel rendelkező modellek esetében javasolt a stabilizátorrúd cseréje a jobb oldai féltengely mozgásának javítása érdekében. A futóműszett rendelkezik Német nyelvű TÜV engedéllyel, mely szerint az ültetés elöl 30-65 mm, hátul 30-65 mm között állítható. Emellett lehetőség van további ültetésre elöl +45 mm, hátul +5 mm tartományban. A termék a németországi Ap-Fahrwerke gyártásával készült, 2 év garanciával. A cikkszáma: GF82-002. Az ár 1 szettre vonatkozik.</p>', 'AP made by KW Skoda Octavia (Typ: 1U), kivéve 4x4, 1997.02-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1u-kiveve-4x4-1997-02-tol-allithato-magassagu-futomu'),
(1063, '', '<strong>Állítható magasságú sport futómű Skoda Octavia (Typ: 1U) modellekhez</strong></p>  <br />20 eltérő keménységi fokozat</p>  <br />Kizárólag olyan járművekhez, melyek rendelkeznek 4x4 meghajtással!</p>  <br />Elülső ültetési intervallum: 35 - 60 mm</p>  <br />Hátsó ültetési intervallum: 30 - 50 mm</p>  <br />Az árucikk rendelkezik TÜV tanúsítvánnyal!</p>  ', 'V-Maxx Skoda Octavia (Typ: 1U), csak 4x4, 1999-2004-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-skoda-octavia-typ-1u-csak-4x4-1999-2004-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1064, '', '<strong>Friss Skoda Octavia RS, VRS (Típus: 1U) V-Maxx sport futómű</strong><br />20 különböző keménységi szinttel rendelkezik<br />Kizárólag RS és VRS modellekhez tervezve<br />Az elülső üléspozíció állítható 35 - 60 mm tartományban<br />A hátsó üléspozíció állítható 30 - 50 mm tartományban<br />Az alkatrész TÜV engedéllyel rendelkezik!', 'V-Maxx Skoda Octavia RS, VRS (Typ: 1U), 1997-2004-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-skoda-octavia-rs-vrs-typ-1u-1997-2004-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1065, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a SKODA OCTAVIA modellekhez, évjáratától függetlenül. Ennek a minőségi kiegészítőnek a segítségével nemcsak javíthatja autója megjelenését, de maximális vezetési élményt is biztosíthat magának. Az ültetés mértéke szabadon állítható, lehetőséget adva a személyre szabott beállításra.\n\nEz a speciális futómű szett két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel ellátottak, így hosszú távon is kiváló teljesítményt nyújtanak.\n\nA termék TÜV minősítéssel rendelkezik, és a gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén. Az ültető rugókra és lengéscsillapítókra 2 év garanciát vállalnak.\n\nA szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezőkkel vagy torziós futóművel vannak felszerelve.\n\nNe felejtsd, hogy a termék Made in Germany, így a minőség és megbízhatóság garantált! </p> <p>Cikkszám: 968223</p>', 'Vogtland Skoda Octavia (Typ: 1U) 2WD, 1997.02-2010-ig állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1u-2wd-1997-02-2010-ig-allithato-magassagu-futomu'),
(1066, '', '<p>A Vogtland állítható magasságú futómű szett kompatibilis a SKODA OCTAVIA típusú autókkal, melyek évjárata 1999-2003. Ennek a futómű szetnek az ültetését 30-55 mm között lehet állítani, és alkalmas Skoda Octavia Typ 1U modellekre, beleértve a Limuzin/Szedán és Kombi/Kombi változatokat is. Az elülső tengely maximális terhelése 1030 kg, míg a hátsó tengelyé 1070 kg lehet.</p>  \n<p>Ez a futómű szett nemcsak javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. A kiegyensúlyozott komfort és fokozott dinamika érdekében a futómű kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel. Ezek a lengéscsillapítók kiváló korrózióvédelmet biztosítanak, és minőségi futóművet garantálnak.</p>  \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>  \n<p>Made in Germany!</p>  \n<p>Cikkszám: 968532</p>', 'Vogtland Skoda Octavia (Typ: 1U), csak 4x4, 1999-2003-ig állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1u-csak-4x4-1999-2003-ig-allithato-magassagu-futomu'),
(1067, '', '<p>Ez az állítható magasságú futóművet VW Golf 4 4WD típusú autókhoz tervezték, legyen az Limousine vagy Variant, 4 vagy 5 hengeres motorral. A futómű tipuskódja 1J, és 1999.04-től használható. A tengelyterhelés elöl 1050 kg, míg hátul 1060 kg. A futómű Német nyelvű TÜV engedéllyel rendelkezik.</p>\n\n<p>A TÜV engedélyben meghatározott ültetés mértéke elöl és hátul 30-55 mm között állítható, de ennél nagyobb intervallumban is lehet állítani. Az engedély csak a fent említett beállításokra vonatkozik. Plusz ültetési lehetőség elöl +20 mm, hátul +0 mm.</p>\n\n<p>A futómű Made In Ap-Fahrwerke Németországban készült, és 2 év garanciával rendelkezik. Azonosítószáma: GF80-031.</p>\n\n<p>Az ár 1 szettre értendő.</p>', 'AP made by KW Skoda Octavia (Typ: 1U) 4x4, 1999.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1u-4x4-1999-11-tol-allithato-magassagu-futomu'),
(1068, '', 'Az Skoda Octavia JOM BLUE LINE futóműve beállítható magasságú. A típuskódja 1Z, és az évjárata 2004-től kezdődik. Különböző motorokkal kompatibilis, mint például 1.9TDi, 1.9TDI DSG, 2.0TDi, 2.0TDi DSG. A változatok között szerepel a Kombi, RS és VRS. A futómű hátsó tengelyénél a magasságállító a rugó alatt található. Fontos, hogy a beszereléshez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szettnek! Az elő- és hátsó tengelyterhelés számai ismertek: elöl 1106-1200kg, hátul pedig 1250kg. A termék MADE IN GERMANY minősítéssel rendelkezik, és német nyelvű TÜV engedéllyel ellátott, amelyet a csomagolás tartalmaz. A futóműhöz 2 ÉV TELJESKÖRŰ GARANCIA jár. Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulccsal. A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot. A kiváló minőségű termék elérhető hihetetlenül jó áron.', 'Jom Bochum Skoda Octavia (Typ: 1Z), 1.9TDi, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, beleértve RS, VRS, Kombi, 2004-től, (első tengely terhelés 1106-1200kg), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-1z-1-9tdi-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-beleertve-rs-vrs-kombi-2004-tol-els-tengely-terheles-1106-1200kg-blue-line-allithato-magassagu-futomu'),
(1069, '', '<p>A Skoda Octavia JOM BLUE LINE futómű egy állítható magasságú futómű, amely tökéletes választás lehet autójához. A futóművet könnyedén be lehet szerelni, és a hátsó tengelynél a magasságállító a rugó alatt található. Fontos, hogy a beszereléshez szükséges rövidített stabilizátor rúd (kutyacsont) nem tartozék a szetthez.</p> <p>Ez a futómű kiváló minőségű, és MADE IN GERMANY minőségi garanciával rendelkezik. A csomagolásban megtalálható a német nyelvű TÜV engedély is. A futómű tengelyterhelése elöl 1105 kg, hátul pedig 1250 kg.</p> <p>Az ültetés mértéke -4 cm és -12 cm között állítható egy speciális állítókulccsal, így könnyedén testre szabható az autóhoz. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 kulcsot. Ne hagyja ki ezt a kiváló ár-érték arányú futóművet!</p>', 'Jom Bochum Skoda Octavia (Typ: 1Z), 1.4, 1.6, 1.8T, 2.0, 2.0TFSi, 2.0TFSi DSG, 1.9TDi, beleértve Kombi, 2004-től, (első tengely terhelés 1105kg alatt), Blue Line  állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-1z-1-4-1-6-1-8t-2-0-2-0tfsi-2-0tfsi-dsg-1-9tdi-beleertve-kombi-2004-tol-els-tengely-terheles-1105kg-alatt-blue-line--allithato-magassagu-futomu'),
(1070, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideálisak azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futóművek magassága fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach vállalat gyártja</li>\n	<li>A magasság szinte minden esetben 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében: sárga cinkbevonat és fekete anódizált alumínium alkatrészek</li>\n	<li>Rugó és lengéscsillapító tökéletes harmóniája</li>\n	<li>A készlet könnyen beépíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1Z), 2004.06-tól, (első tengely terhelés 1036-1170kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1z-2004-06-tol-els-tengely-terheles-1036-1170kg-street-series-allithato-magassagu-futomu'),
(1071, '', '<p>Az Audi A3 MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árat. Ez a futómű folyamatosan szabályozható magassággal rendelkezik, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik sport futóművei kiemelkedő egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n<u>Termékjellemzők:</u>\n<ul>\n	<li>A futóművek rugóit az elismert <strong>Eibach</strong> gyártja</li>\n	<li>A magasság széles skálán, általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is</li>\n	<li>Két rétegű bevonat védi hosszú távon a korróziót (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Ideális egyensúlyt teremt a rugók és a lengéscsillapítók között</li>\n	<li>Az összeszereléshez nincs szükség autó felfüggesztésének módosítására, a készlet plug & play</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1Z), 2004.06-tól, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1z-2004-06-tol-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu'),
(1072, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei kiváló választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p>Az MTS-Technik Sport futóművek alkalmazhatók az alábbi típusokhoz:</p>\n<ul>\n	<li>Audi A3 (Typ: 8P)</li>\n	<li>Audi A3 Sportback (Typ: 8P)</li>\n	<li>Audi A3 Cabrio (Typ: 8P)</li>\n	<li>Első tengely terhelés: 1035kg alatt</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n	<li>Ültetés mértéke elől: 35-70mm</li>\n	<li>Ültetés mértéke hátul: 35-60mm</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>Fontos! Rövidített stabilizátor rúd használata ajánlott (nem tartalmazza a készlet)</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1Z), 2004.06-tól, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1z-2004-06-tol-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(1073, '', '<strong>Állítható magasságú sport futómű az Audi A3-hoz MTS-Technik Sport Series-től</strong></p>  <p>A MTS-Technik Sport Series sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni! Az állítható magasságú futóművek lehetővé teszik az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az Eibach rugók és az MTS-Technik lengéscsillapítók optimális összhangban vannak, biztosítva ezzel a maximális vezetési élményt és széles ültetési tartományt.</p>  <p>Az Audi A3, A3 Sportback és A3 Cabrio modellekhez tervezett futóművek specifikációi:</p>  <ul> 	<li>Audi A3 (Typ: 8P), 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li>Audi A3 Sportback (Typ: 8P), 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li>Audi A3 Cabrio (Typ: 8P), 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1036-1170kg</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elől: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A rugókat az Eibach gyártja</li> 	<li>Speciális Eibach rugók maximális sportossághoz</li> 	<li>A Sport Series célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></p> ', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 1Z), 2004.06-tól, (első tengely terhelés 1036-1170kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-1z-2004-06-tol-els-tengely-terheles-1036-1170kg-sport-series-allithato-magassagu-futomu'),
(1074, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, lehetőséget biztosítva számukra arra, hogy a kívánt ültetést milliméter pontosan beállíthassák. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözésével maximális ültetést nyújtunk.</span></div> <div><span>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmóniája optimális összeállítást eredményez.</span></div> <ul>     <li><span>kiváló minőség elérhető áron</span></li>     <li><span>egyedi magasságbeállítás TÜV engedélyezett tartományban</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kivételes ár-érték arány</span></li>     <li><span>német minőségű termék</span></li> </ul>', 'AP made by KW Skoda Octavia (Typ: 1Z), 50mm szárátmérő, 2003.09-től, (első tengely terhelés 1106kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1z-50mm-szaratmer-2003-09-tol-els-tengely-terheles-1106kg-folott-allithato-magassagu-futomu'),
(1075, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy milliméter pontossággal állítsa be a kívánt üléspozíciót. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözésével, maximális ülésmagassággal.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg lehet beállítani a TÜV által engedélyezett tartományon belül. A sportosság, a kényelem és a biztonság harmonikus egyensúlyban történő összehangolása optimális konfigurációt eredményez.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőség és megbízhatóság</li>\\r\\n</ul>\\r\\n', 'AP made by KW Skoda Octavia (Typ: 1Z), beleértve RS, 55mm szárátmérő, 2003.09-től, (első tengely terhelés 1106kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1z-beleertve-rs-55mm-szaratmer-2003-09-tol-els-tengely-terheles-1106kg-folott-allithato-magassagu-futomu'),
(1076, '', '<div><span>Az Ap futómű célja a sportosan ambiciózus vezetők igényeinek kielégítése, lehetővé téve számukra a milliméteres pontosságú ültetés beállítását. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kombinálva, maximalizálva ezzel az ültetési lehetőségeket.</span></div> <div><span>Egy alumínium rugótányér segítségével a jármű magasságát szabályozhatjuk az engedélyezett TÜV tartományon belül egyénileg. A sportosság, kényelem és biztonság harmóniájának megteremtése révén optimális konfigurációt biztosítunk.</span></div> <ul>\n    <li><span>kiváló minőségű termék megfizethető áron</span></li>\n    <li><span>egyedi magasságbeállítás az engedélyezett TÜV tartományon belül</span></li>\n    <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>\n    <li><span>kivételes ár-érték arány</span></li>\n    <li><span>német minőség</span></li>\n</ul>', 'AP made by KW Skoda Octavia (Typ: 1Z), 50mm szárátmérő, 2003.09-től, (első tengely terhelés 1036-1105kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1z-50mm-szaratmer-2003-09-tol-els-tengely-terheles-1036-1105kg-allithato-magassagu-futomu'),
(1077, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy precízen beállítsák a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</span></div> <div><span>Alumínium rugótányér segítségével egyéni beállítási lehetőség áll rendelkezésre a járműmagasság tekintetében, a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot párhuzamosan összehangolva optimális felépítést biztosítunk.</span></div> <ul>     <li><span>Kiemelkedő minőség kedvező áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Skoda Octavia (Typ: 1Z), 50mm szárátmérő, 2003.09-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1z-50mm-szaratmer-2003-09-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1078, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy pontosan beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kínálva a maximális ültetéssel kombinálva.</span></div> <div><span>Egy alumínium rugótányér segítségével a járműmagasság szabályozható az engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtve optimális konfigurációt nyújt.</span></div> <ul>     <li><span>Magas minőségű termék elérhető áron</span></li>     <li><span>Lehetőség egyéni magasság beállítására a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiváló ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Skoda Octavia (Typ: 1Z), beleértve RS, 55mm szárátmérő, 2003.09-től, (első tengely terhelés 1036-1105kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1z-beleertve-rs-55mm-szaratmer-2003-09-tol-els-tengely-terheles-1036-1105kg-allithato-magassagu-futomu'),
(1079, '', '<div><span>Az Ap futómű kifejezetten azon vezetők számára lett tervezve, akik szeretik a sportos vezetési stílust. A futómű lehetővé teszi a precíz ültetés beállítását, így optimális irányíthatóságot és vezetési élményt biztosítva.</span></div> <div><span>Egy alumínium rugótányér segítségével könnyedén állítható a jármű magassága a TÜV által előírt határokon belül. A sportosság, kényelem és biztonság tökéletes egyensúlyban van, így optimális teljesítményt nyújtva.</span></div> <ul>     <li><span>Kiemelkedő minőség, megfizethető áron</span></li>     <li><span>Lehetőség egyéni magasság beállítására a TÜV által előírt tartományon belül</span></li>     <li><span>Magas minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár-érték arány</span></li>     <li><span>Német precizitás és minőség</span></li> </ul>', 'AP made by KW Skoda Octavia (Typ: 1Z), beleértve RS, 55mm szárátmérő, 2003.09-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-1z-beleertve-rs-55mm-szaratmer-2003-09-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1080, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: SKODA OCTAVIA<br /> </span></div> <ul>     <li><strong>Ültetés mértéke</strong>: 25 - 50 / 25 - 50 mm</li>     <li><strong>Típus</strong>: Skoda Octavia, Typ 1Z, Lim. / Sedan, Kombi, beleértve RS, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése akár 1060 kg, kivéve 4 WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (maximum) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett maximális vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét az egyéni igények szerint lehet beállítani a megfelelő értékek között. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a minőséget.</p> <p>A termék rendelkezik TÜV minősítéssel. A több mint 100 éves tapasztalattal rendelkező gyártó cég 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel rendelkeznek.</p> <p>Made in Germany!</p> <p>Cikkszám: 968268</p>', 'Vogtland Skoda Octavia (Typ: 1Z), 2003.09-től, 55mm szárátmérő (első tengely terhelés: 1036-1060kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1z-2003-09-tol-55mm-szaratmer-els-tengely-terheles-1036-1060kg-allithato-magassagu-futomu'),
(1081, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SKODA OCTAVIA<br /> </span></div> <ul>     <li><strong>Ültetés mértéke</strong>: 25 - 50 / 25 - 50 mm</li>     <li><strong>Típus</strong>: Skoda Octavia, Typ 1Z, Lim. / Sedan, Kombi, a lengéscsillapító ház átmérõ 50 mm, az elsõ tengely terhelése legfeljebb 1160 kg, kivéve 4 WD</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1160 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett páratlan vezetési élményt nyújt. Az ültetés mértékét egyedi elképzeléseinek megfelelően állíthatja be. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók első osztályú korrózióvédelmet biztosítanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>Németországban gyártva!</p> <p>Cikkszám: 968269</p>', 'Vogtland Skoda Octavia (Typ: 1Z), 2003.09-től, 50mm szárátmérő (első tengely terhelés: 1061-1160kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1z-2003-09-tol-50mm-szaratmer-els-tengely-terheles-1061-1160kg-allithato-magassagu-futomu'),
(1082, '', '<div><strong>Vogtland</strong><span> magasságállítható futómű</span><span>: SKODA OCTAVIA<br /> </span></div> <ul>     <li><strong>Ültetés mértéke</strong>: 25 - 50 / 25 - 50 mm</li>     <li><strong>Típus</strong>: Skoda Octavia, Typ 1Z, Lim. / Sedan, Kombi, beleértve RS, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése maximum 1160 kg, kivéve 4 WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (maximum) 1160 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett a termék optimális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint lehet beállítani. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók biztosítják a tartósságot.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A futómű szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968270</p>', 'Vogtland Skoda Octavia (Typ: 1Z), 55mm szárátmérő, 2003.09-től, (első tengely terhelés 1061-1160kg-ig) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1z-55mm-szaratmer-2003-09-tol-els-tengely-terheles-1061-1160kg-ig-allithato-magassagu-futomu'),
(1083, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: SKODA OCTAVIA<br /> </span></div> <ul>     <li><strong>Ültetés mértéke</strong>: 25 - 50 / 25 - 50 mm</li>     <li><strong>Típus</strong>: Skoda Octavia, Typ 1Z, Lim. / Sedan, Kombi, a lengéscsillapító ház átmérője 50 mm, az első tengely terhelése legfeljebb 1060 kg, kivéve 4 WD</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésének javítása mellett kiemelkedő vezetési élményt nyújt. Az ültetés mértékét saját igényei szerint állíthatja. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültető rugókra és lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel rendelkeznek.</p> <p>Manufactured in Germany!</p> <p>Cikkszám: 968267</p>', 'Vogtland Skoda Octavia (Typ: 1Z), 2003.09-től, 50mm szárátmérő (első tengely terhelés: 1036-1060kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1z-2003-09-tol-50mm-szaratmer-els-tengely-terheles-1036-1060kg-allithato-magassagu-futomu'),
(1084, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: SKODA OCTAVIA</span></div>  <ul> 	<li><strong>Ültetés mértéke</strong>: lehetőség van az ültetés mértékének saját elképzelés szerinti beállítására</li> 	<li><strong>Típus</strong>: a futómű alkalmas Skoda Octavia, Typ 1Z, Lim. / Sedan, Kombi modellekhez, a lengéscsillapító ház átmérője 50 mm, az első tengely maximális terhelése 1035 kg (kivéve 4 WD)</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1035 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul>  <p>Az autó megjelenésén javító Vogtland állítható magasságú futómű szett optimális vezetési élményt nyújt. A futómű speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező- vagy torziós futóművet alkalmaznak.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968265</p> ', 'Vogtland Skoda Octavia (Typ: 1Z), 2003.09-től, 50mm szárátmérő (első tengely terhelés: 1035kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1z-2003-09-tol-50mm-szaratmer-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1085, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: SKODA OCTAVIA<br /> </span></div> <ul>     <li><strong>Ültetés mértéke</strong>: széles tartományban állítható</li>     <li><strong>Típus</strong>: Skoda Octavia, Typ 1Z, Lim. / Sedan, Kombi, a lengéscsillapító ház átmérõje 55 mm, az elsõ tengely maximális terhelése 1035 kg, kivéve 4 WD</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 1035 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul> <p>Az autó megjelenésén javítva, ez a futómű szett optimális vezetési élményt biztosít. Az ültetés mértékét egyéni elképzeléseinek megfelelően állíthatja be. A futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A szett alapvetően 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Németországban gyártva!</p> <p>Cikkszám: 968266</p>', 'Vogtland Skoda Octavia (Typ: 1Z), 2003.09-től, 55mm szárátmérő (első tengely terhelés: 1035kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-1z-2003-09-tol-55mm-szaratmer-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1086, '', '<p>Ez az alkatrész ideális választás a Skoda Octavia autóhoz, melyhez típuskódot is megadunk (5E) és évjáratot (2012-től). Fontos megjegyezni, hogy kizárólag Multilink futómű nélküli modellekhez ajánljuk. A beszereléshez szükséges rövidített stabilizátor rúd nem része ennek a szettnek. A tengelyterhelés elöl 965 kg, míg hátul 1060 kg. Ne feledkezzünk meg róla, hogy a termék \"MADE IN GERMANY\" minőséget képvisel, TÜV engedéllyel rendelkezik, melyet a csomagolásban megtalálunk. Emellett 2 év teljeskörű garanciával kapható! A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint egy állítókulcsot.</p>', 'Jom Bochum Skoda Octavia (Typ: 5E) beleértve Kombi, kivéve Multilink futóműhöz, 2012-től, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-5e-beleertve-kombi-kiveve-multilink-futomuhoz-2012-tol-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(1087, '', '<p>Ez az alkatrész tökéletesen illeszkedik az alábbi autótípushoz:</p>\n<ul>\n    <li>Skoda Octavia</li>\n    <li>Típuskód: 5E</li>\n    <li>Évjárat: 2012-től</li>\n    <li>Csak Multilink futóművel szerelt</li>\n    <li>FIGYELEM! Ennek a futóműnek a rövidített stabilizátor rúd (kutyacsont) szükséges a beszereléshez, amely nem tartozék ebben a szettben!!</li>\n    <li>Tengelyterhelés elöl: 1080 kg</li>\n    <li>Tengelyterhelés hátul: 1060 kg</li>\n</ul>\n<ul>\n    <li>MADE IN GERMANY</li>\n    <li>Ez a futómű rendelkezik <strong>TÜV</strong> engedéllyel, amelyet a csomagolás tartalmaz.</li>\n    <li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\n    <li>Kiváló minőség, rendkívül kedvező áron!!!</li>\n    <li>A szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</li>\n</ul>', 'Jom Bochum Skoda Octavia (Typ: 5E) beleértve Kombi,csak Multilink futóműhöz, 2012-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-5e-beleertve-kombicsak-multilink-futomuhoz-2012-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1088, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást jelentenek azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach cég gyártja</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>A futómű magassága általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonattal ellátva a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>Az összeállítás plug & play jellegű, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 5E), beleértve Kombi, kivéve MultiLink futóművel szerelt, 2012.11-től, (első tengely terhelés 981-1140kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-5e-beleertve-kombi-kiveve-multilink-futomuvel-szerelt-2012-11-tol-els-tengely-terheles-981-1140kg-allithato-magassagu-futomu'),
(1089, '', '<p>Az állítható magasságú sport futóművek ideális választást nyújtanak azoknak a vásárlóknak, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek lehetővé teszik a magasság fokozatmentes állítását, így könnyedén alkalmazkodhatnak az útviszonyokhoz. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach cég gyártja</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiváló hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 5E), beleértve Kombi, csak MultiLink futóművel szerelt, 2012.11-től, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-5e-beleertve-kombi-csak-multilink-futomuvel-szerelt-2012-11-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(1090, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Volkswagen Golf 7 Hatchback,</strong> 1.0TSI, 1.2TSI, 1.4TSI, 1.4TSI MultiFuel, 1.4TGI, 1.5TSI, 1.5TGI, 1.6, 2.0GTI, 2.0GTI Clubsport, 1.6TDi, 2.0TDi, 2.0GTD, 2.0R 4motion, 1.6TDi 4motion, 2.0TDi 4motion</li> 	<li><strong>Volkswagen Golf 7 Variant,</strong> 1.0TSI, 1.2TSI, 1.4TSI, 1.4TSI MultiFuel, 1.4TGI, 1.5TSI, 1.5TGI, 1.6, 2.0GTI, 2.0GTI Clubsport, 1.6TDi, 2.0TDi, 2.0GTD, 2.0R 4motion, 1.6TDi 4motion, 2.0TDi 4motion</li> 	<li><strong>Csak Multilink futóművel szerelt típusokhoz</strong></li> 	<li>Első tengely terhelés: 981-1180 kg</li> 	<li>Hátsó tengely terhelés: 1050 kg alatt</li> 	<li>Ültetés mértéke elől: 35-70 mm</li> 	<li>Ültetés mértéke hátul: 35-70 mm</li> 	<li>Figyelem! A beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott! A szett NEM tartalmazza!</li> </ul>  <p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azoknak, akik számára fontos a kiváló minőség és a megfizethető ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóműveiben ideális az egyensúly a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a termék TÜV engedéllyel rendelkezik</li> 	<li>a magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiváló hatékonyság extrém körülmények között is</li> 	<li>kettős bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>tökéletes egyensúly a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> ', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 5E), beleértve Kombi, csak MultiLink futóművel szerelt, 2012.11-től, (első tengely terhelés 981-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-5e-beleertve-kombi-csak-multilink-futomuvel-szerelt-2012-11-tol-els-tengely-terheles-981-1180kg-allithato-magassagu-futomu'),
(1091, '', '<strong>MTS-Technik rugós sport futómű állítható magassággal</strong></p>\n<ul>\n<li><strong>Volkswagen Golf 7 Hatchback modellre</strong> készült</li>\n<li><strong>Volkswagen Golf 7 Variant modellre</strong> készült</li>\n<li><strong>Nem kompatibilis Multilink futóművel rendelkező modellekkel</strong></li>\n<li>Első tengely maximális terhelése: 980 kg</li>\n<li>Hátsó tengely maximális terhelése: 1050 kg</li>\n<li>Elülső ültetési mérték: 35-70 mm</li>\n<li>Hátsó ültetési mérték: 35-70 mm</li>\n<li>Fontos! Az állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott a beszereléshez! A szett nem része a terméknek!</li>\n</ul>\n<p>A MTS-Technik rugós sport futóművei ideális választás azoknak, akik számára fontos a minőség és az megfizethető ár. A fokozatmentesen állítható magasság lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben harmonikus az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n<li>TÜV engedéllyel rendelkezik</li>\n<li>A magasság széles határok között állítható (25-80 mm)</li>\n<li>Gáztöltésű lengéscsillapítók</li>\n<li>Kiváló hatékonyság extrém körülmények között is</li>\n<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li>\n<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: 5E), beleértve Kombi, kivéve MultiLink futóművel szerelt, 2012.11-től, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-5e-beleertve-kombi-kiveve-multilink-futomuvel-szerelt-2012-11-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(1092, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy a kívánt ültetést milliméter pontosan beállítsák. A sportos irányíthatóságot és optimális vezetési magatartást ötvözzük a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot összehangoljuk egy optimális felépítés érdekében.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>prémium minőség megfizethető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kivételes ár-érték arány</li>\\r\\n	<li>német minőségbiztosítás</li>\\r\\n</ul>\\r\\n', 'AP made by KW Skoda Octavia (Typ: 5E), kivéve Multilink futóművel szerelt, 2013.02-től, 50mm szárátmérő, (első tengely terhelés 926-1060kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-5e-kiveve-multilink-futomuvel-szerelt-2013-02-tol-50mm-szaratmer-els-tengely-terheles-926-1060kg-allithato-magassagu-futomu'),
(1093, '', '<div><span>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, lehetővé téve számukra, hogy precízen beállítsák az általuk kívánt ültetést. Az optimális vezetési élmény és sportos irányíthatóság egyesítve található meg a maximális ültetéssel.</span></div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével könnyedén beállítható a jármű magassága a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmóniáját biztosító optimális felépítés jellemzi ezt a futóművet.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Magas minőségű alkatrészek elérhető áron</li>\\r\\n	<li>Egyedi magasságbeállítási lehetőség a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány biztosított</li>\\r\\n	<li>Kiemelkedő ár-érték arány</li>\\r\\n	<li>Német minőség és megbízhatóság</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos tudnivaló: Ebben a futóműben csak a magasság állítható, a keménység nem módosítható!</div>\\r\\n', 'AP made by KW Skoda Octavia (Typ: 5E), kivéve Multilink futóművel szerelt, 2013.02-től, 50mm szárátmérő, (első tengely terhelés 925kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-5e-kiveve-multilink-futomuvel-szerelt-2013-02-tol-50mm-szaratmer-els-tengely-terheles-925kg-alatt-allithato-magassagu-futomu'),
(1094, '', '<div><strong>Seat Leon (Típus: 5F) ST AP KW által gyártott állítható futómű</strong></div>\\r\\n\\r\\n<ul>\\r\\n	<li>Csak Multilink felfüggesztéssel rendelkezik</li>\\r\\n	<li>Vázméret: 55mm</li>\\r\\n	<li>Összkerékhajtás</li>\\r\\n	<li>Elülső tengely terhelhetőség 966-1090kg között</li>\\r\\n	<li>Hátsó tengely terhelhetőség 1050kg alatt</li>\\r\\n	<li>Elülső ültetési tartomány: 35-65mm</li>\\r\\n	<li>Hátsó ültetési tartomány: 35-65mm</li>\\r\\n</ul>\\r\\n\\r\\n<div>\\r\\n<p>Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy milliméteres pontossággal beállítsák a kívánt ültetést. A sportos vezethetőség és optimális vezetési viselkedés kombinációját nyújtjuk, maximalizálva az ültetés lehetőségeit.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot optimalizált módon ötvözzük.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>magas minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiemelkedő ár-érték arány</li>\\r\\n	<li>német precizitás</li>\\r\\n</ul>\\r\\n\\r\\n<p>Fontos! Ezen futómű esetében csak a magasság állítható, a keménység nem!</p>\\r\\n</div>\\r\\n', 'AP made by KW Skoda Octavia (Typ: 5E), csak Multilink futóművel szerelt, 2013.02-től, 55mm szárátmérő, (első tengely terhelés 926-1090kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-octavia-typ-5e-csak-multilink-futomuvel-szerelt-2013-02-tol-55mm-szaratmer-els-tengely-terheles-926-1090kg-allithato-magassagu-futomu'),
(1095, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a Skoda Octavia 4x4 modellekhez, évjáratától függetlenül. Ez a futómű szett lehetővé teszi az ültetés mértékének szabályozását 0-30 mm-es tartományban, biztosítva ezzel a maximális vezetési élményt. A Skoda Octavia Typ 5E Sedan RS és Kombi RS modellekhez tervezett futómű kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát nyújtanak.</p>\n\n<p>Ezek a lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, és TÜV minősítéssel ellátottak. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más típusú futóművet használnak.</p>\n\n<p>Ez a minőségi futómű szett Made in Germany!</p>', 'Vogtland Skoda Octavia RS (Typ: 5E), beleértve Kombi, csak 4x4, 2013.08-tól, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-rs-typ-5e-beleertve-kombi-csak-4x4-2013-08-tol-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1096, '', '<p>Vogtland által készített állítható magasságú futómű szett a Skoda Octavia modellekhez, kezdve a 2013-as évtől. Ez a futómű lehetővé teszi az ültetés mértékének állítását 35-65 mm-el elöl és 30-60 mm-el hátul. Az alkalmazható típusok közé tartozik a Skoda Octavia Typ 5E, 2WD, Limousine / Sedan, kivéve a Multilink felfüggesztést, ahol a lengéscsillapító ház átmérője 50 mm.</p>\n<p>Az egyik fő előnye ennek a futómű szettnek az, hogy nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. Emellett az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó kiváló teljesítményéhez.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugó gyártás területén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n<p>A termék Made in Germany! Cikkszám: 968742</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, kivéve Multilink futóművel, 2013.02-től, 50mm szárátmérő, (első tengely terhelés 925kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-kiveve-multilink-futomuvel-2013-02-tol-50mm-szaratmer-els-tengely-terheles-925kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1097, '', '<p>A <strong>Vogtland</strong> futómű szett ideális választás a <strong>SKODA OCTAVIA</strong> modellekhez, melynek évjárata 2013-tól kezdődik. Ez a minőségi futómű szett lehetővé teszi az ültetés mértékének szabályozását 10-40 mm tartományban. A Skoda Octavia Typ 5E Limousine / Sedan RS és Combi RS modellekhez tervezett futóműhöz 55 mm átmérőjű lengéscsillapító ház tartozik, kivéve az elektronikus lengéscsillapítót.</p> \n\n<p>Ez a futómű szett nem csupán javítja az autó megjelenését, hanapság vezetési élményt is nyújt. A speciális két csöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, ami kiegyensúlyozott kényelmet és fokozott dinamikát biztosít. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p> \n\n<p>Ez a TÜV minősítéssel rendelkező termék 2 év garanciát kap a gyártótól, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén. A szett általában 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p> \n\n<p>A termék Made in Germany!</p> \n\n<p>Cikkszám: 968759</p>', 'Vogtland Skoda Octavia RS (Typ: 5E), beleértve Kombi, kivéve 4x4, 2013.08-tól, (első tengely terhelés 1090kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-rs-typ-5e-beleertve-kombi-kiveve-4x4-2013-08-tol-els-tengely-terheles-1090kg-alatt-allithato-magassagu-futomu'),
(1098, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a 2013-tól gyártott SKODA OCTAVIA 4X4 modellekhez. Ez a minőségi futómű szett nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetés mértékét könnyedén személyre szabhatja a megfelelő értékek segítségével. A speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, ami kiegyensúlyozott komfortot és fokozott dinamikát biztosít. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>Ez a TÜV minősítéssel ellátott termék 2 év garanciát kínál az ültető rugókra és a lengéscsillapítókra. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, és a szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autók esetében.</p>\n<p>A Vogtland futómű szettje Made in Germany!</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, csak 4x4 és Multilink futóművel, 2013.07-től, 50mm szárátmérő, (első tengely terhelés 1010kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-csak-4x4-es-multilink-futomuvel-2013-07-tol-50mm-szaratmer-els-tengely-terheles-1010kg-alatt-allithato-magassagu-futomu'),
(1099, '', '<p>A Vogtland által gyártott állítható magasságú futómű szettet a SKODA OCTAVIA modellekhez tervezték. Az érvényes évjárattól kezdve a futómű ültetésének mértéke 35-65 mm elöl és 30-60 mm hátul. Ez a futóműszett kifejezetten a Skoda Octavia Typ 5E, 2WD, Limousine/Sedan típusú autókhoz készült, kivéve a Multilink felfüggesztésű modelleket, ahol a lengéscsillapító ház átmérője 50 mm.</p>\n<p>A futómű maximális tengelyterhelése elöl 926-1080 kg, míg hátul 980 kg. A Vogtland által kiadott engedély az alábbi linken érhető el: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF27-28_1115-14.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW810GF27-28_1115-14.pdf</a>.</p>\n<p>Ez a futóműszett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. A beállítható ültetési magasság lehetővé teszi a személyre szabott beállítást. A minőségi futóműszett magában foglalja a speciális, nagy teljesítményű kéttömegű lengéscsillapítókat, amelyek alacsony nyomású gázrendszerük révén kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, ahol szintező- vagy torziós futómű van szerelve.</p>\n<p>Made in Germany!</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, kivéve Multilink futóművel, 2013.02-től, 50mm szárátmérő, (első tengely terhelés 926-1080kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-kiveve-multilink-futomuvel-2013-02-tol-50mm-szaratmer-els-tengely-terheles-926-1080kg-allithato-magassagu-futomu'),
(1100, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a 2013-tól gyártott SKODA OCTAVIA 4X4 modellekhez. Ez a minőségi futómű szett lehetővé teszi az autó megjelenésének javítását és maximális vezetési élményt nyújt. A futómű szett lehetőséget biztosít az ültetés mértékének egyéni beállítására, és kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó kiváló vezethetőségéhez.</p>  \n<p>Ez a termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>A termék Made in Germany!</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, csak 4x4 és Multilink futóművel, 2013.07-től, 55mm szárátmérő, (első tengely terhelés 1010kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-csak-4x4-es-multilink-futomuvel-2013-07-tol-55mm-szaratmer-els-tengely-terheles-1010kg-alatt-allithato-magassagu-futomu'),
(1101, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett ideális választás a 2013-tól gyártott Skoda Octavia modellekhez. Ez a minőségi futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortérzetet és fokozott dinamikát biztosítanak. Az ültetés mértéke szabadon állítható a 35-65 mm-el elöl és 30-60 mm-el hátul, így a felhasználó saját elképzeléseinek megfelelően alakíthatja az autó megjelenését és vezetési élményét.</p> <p>A Vogtland futómű szett alkalmas Skoda Octavia Typ 5E modellekhez, kivéve a Multilink felfüggesztésű változatokat, ahol a lengéscsillapító ház átmérője 55 mm. Az előre tervezett maximális tengelyterhelés elöl 926-1080 kg, míg hátul 980 kg lehet. A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p> <p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. Fontos kiemelni, hogy a termék Made in Germany, tehát a minőség és megbízhatóság garantált.</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, kivéve Multilink futóművel, 2013.02-től, 55mm szárátmérő, (első tengely terhelés 926-1080kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-kiveve-multilink-futomuvel-2013-02-tol-55mm-szaratmer-els-tengely-terheles-926-1080kg-allithato-magassagu-futomu'),
(1102, '', '<p>A Vogtland által készített állítható magasságú futómű szett Skoda Octavia modellekhez, 2013-tól gyártott verziókhoz ajánlott. A futómű lehetséges ültetési mértéke 35-65 mm elöl és 30-60 mm hátul. Ez a minőségi futómű szett kifejezetten a Skoda Octavia típusokhoz lett tervezve, a lengéscsillapító ház átmérője 50 mm. Az elülső tengely maximális terhelése legfeljebb 925 kg, míg a hátsó tengelyé 1050 kg lehet. \n\nEz a futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel vannak ellátva, biztosítva ezzel a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, és TÜV minősítéssel rendelkeznek. A gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. \n\nA futómű szett tartalma általában 4 db ültető rugó és 4 db lengéscsillapító, kivéve azoknál az autótípusoknál, amelyek más típusú futóművet használnak. A termék Made in Germany!</p>\n<p>Cikkszám: 968760</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, csak Multilink futóművel, 2013.02-től, 50mm szárátmérő, (első tengely terhelés 925kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-csak-multilink-futomuvel-2013-02-tol-50mm-szaratmer-els-tengely-terheles-925kg-alatt-allithato-magassagu-futomu'),
(1103, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett Skoda Octavia modellekhez ideális. Ez a minőségi futómű javítja az autó megjelenését és optimális vezetési élményt nyújt. A futómű szett lehetőséget biztosít az ültetés mértékének személyre szabott beállítására. A kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel rendelkeznek, így kiegyensúlyozott komfortot és fokozott dinamikát garantálnak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hosszú élettartamot biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968762</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, csak Multilink futóművel, 2013.02-től, 55mm szárátmérő, (első tengely terhelés 925kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-csak-multilink-futomuvel-2013-02-tol-55mm-szaratmer-els-tengely-terheles-925kg-alatt-allithato-magassagu-futomu'),
(1104, '', '<p><strong>Vogtland</strong> állítható magasságú futómű szett a SKODA OCTAVIA modellekhez.</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2013-tól</li>\n	<li><strong>Ültetés mértéke</strong>: 35 - 65 / 30 - 60 mm</li>\n	<li><strong>Típus</strong>: Skoda Octavia, Typ 5E, 2WD, Lim. / Sedan, Kombi, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 50 mm, kivéve elektronikus lengéscsillapító, az elsõ tengely terhelése több mint 925 kg</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: (több mint 925 kg) 1090 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li>\n	<li><strong>Engedély</strong>:</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland futómű szett maximális vezetési élményt biztosít. Az ültetés mértékét személyes igényei szerint állíthatja. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>\n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintezős vagy torziós futóművet szereltek.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968775</p>', 'Vogtland Skoda Octavia (Typ: 5E), beleértve Kombi, csak Multilink futóművel, 2013.02-től, 50mm szárátmérő, (első tengely terhelés 926-1080kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-octavia-typ-5e-beleertve-kombi-csak-multilink-futomuvel-2013-02-tol-50mm-szaratmer-els-tengely-terheles-926-1080kg-allithato-magassagu-futomu'),
(1105, '', '<strong>Skoda Octavia JOM Blueline állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Skoda Octavia Kombi,</strong> valamint 1.0 TSI, 1.5 TSI és 2.0 TDI motorváltozatokkal</li>\\r\\n	<li><strong>Skoda Octavia Sedan,</strong> szintén 1.0 TSI, 1.5 TSI és 2.0 TDI motorokkal</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Csak olyan Skoda Octavia modellekhez, amelyek Multilink futóművel vannak felszerelve</li>\\r\\n	<li>Az első tengely maximális terhelése: 1035 kg</li>\\r\\n	<li>A hátsó tengely maximális terhelése: 980 kg</li>\\r\\n	<li>Fontos tudnivaló! A beszereléshez ajánlott egy állítható hosszúságú stabilizátor szett (kutyacsont), mely nem része ennek a futóműszetnek!</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel</li>\\r\\n	<li>Az engedélyben meghatározott ültetési lehetőségek: elöl 20-55 mm, hátul 30-55 mm között állítható<br />\\r\\n	(A futómű szélesebb tartományban is állítható, azonban a TÜV engedély csak az említett beállításokra vonatkozik.)</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártva JOM németországi üzemében</li>\\r\\n</ul>\\r\\n\\r\\n<p>A JOM Blueline állítható magasságú futóműszett kiváló minőségű, autóspecifikus alkatrészekből áll össze.</p>\\r\\n\\r\\n<p>A futómű magassága az egyéni igények szerint állítható a fent említett paraméterek között.</p>\\r\\n\\r\\n<p>A rugók keménysége és a csillapítás mértéke egységes marad az összes beállításnál.</p>\\r\\n\\r\\n<p>A futómű kivételesen nagy kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>\\r\\n', 'Jom Bochum Skoda Octavia (Typ: NX), csak Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-nx-csak-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1106, '', '<p>Egy olyan futómű, amelyet Skoda Octavia Kombi és Sedan modellekhez ajánlunk, melyek Multilink futóművel vannak felszerelve. Az első tengely terhelése 1036-1100 kg, míg a hátsó tengely terhelése 980 kg alatt van. Fontos megjegyezni, hogy a beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) szükséges, mely nem része ennek a készletnek.</p>\n\n<p>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel, mely szerint az ültetés mértéke elöl 20-55mm, hátul 30-55mm között állítható. A futómű gyakran nagyobb intervallumban is állítható, azonban a TÜV engedély csak a fenti beállításokat teszi lehetővé.</p>\n\n<p>A JOM Blueline Állítható magasságú futóműszett Németországban készült, és kiváló minőségű autó-specifikus alkatrészekből áll.</p>\n\n<p>Ez a futómű lehetővé teszi az egyéni magasságbeállítást a fent említett paraméterek között, a rugó keménysége és a csillapítás mértéke pedig az egész beállítási tartományban állandó. A futómű kivételesen nagy kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>', 'Jom Bochum Skoda Octavia (Typ: NX), csak Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 1036-1100kg) állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-nx-csak-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-1036-1100kg-allithato-magassagu-futomu'),
(1107, '', '<p>Egy állítható magasságú sport futómű Skoda Octavia modellekhez.</p>\n\n<ul>\n	<li>Elérhető Skoda Octavia Kombi és Sedan változatokhoz, 1.4 TSI, 1.5 TSI, 2.0 TSI, valamint 2.0 TDI motorokhoz.</li>\n	<li>Nem kompatibilis Multilink futóművel rendelkező típusokkal.</li>\n	<li>Terhelés első tengelyen: legfeljebb 1035 kg, hátsó tengelyen: legfeljebb 980 kg.</li>\n	<li>Fontos: Ajánlott egy állítható hosszúságú stabilizátor szett (kutyacsont) beszerelése, amely nem tartozék a csomaghoz.</li>\n</ul>\n\n<ul>\n	<li>A futóműszett rendelkezik német nyelvű TÜV engedéllyel.</li>\n	<li>Az engedély által meghatározott ültetési mérték: elöl 20-55mm, hátul 30-55mm között állítható. (A futómű gyakran nagyobb intervallumban is állítható, de az engedély csak ezen beállításokra vonatkozik.)</li>\n</ul>\n\n<ul>\n	<li>JOM Blueline futómű, gyártva Németországban.</li>\n</ul>\n\n<p>Ez a futóműszett magas minőségű autóspecifikus alkatrészekből áll.</p>\n\n<p>A magasság beállítása személyes igények szerint változtatható az előzőleg említett paraméterek között.</p>\n\n<p>A rugó keménysége és a csillapítás mértéke az egész beállítási tartományban konzisztens.</p>\n\n<p>A futómű különleges kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>', 'Jom Bochum Skoda Octavia (Typ: NX), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-nx-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1108, '', '<p>Egy olyan futómű, amely lehetővé teszi a Skoda Octavia járművek magasságának állítását, kiváló minőségű alkatrészekből áll. A magasság beállítása személyes preferenciák szerint módosítható a megadott paraméterek között. A rugó keménysége és a csillapítás mértéke az összes beállítási lehetőség során állandó marad. A futómű kivételes kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>\n\n<ul>\n	<li><strong>Skoda Octavia Kombi,</strong> 1.4 TSI/ 1.5 TSI/ 2.0 TSI/ 2.0 TDI</li>\n	<li><strong>Skoda Octavia Sedan,</strong> 1.4 TSI/ 1.5 TSI/ 2.0 TSI/ 2.0 TDI</li>\n</ul>\n\n<ul>\n	<li><strong>Kivéve Multilink futóművel szerelt típusokhoz</strong></li>\n	<li>Első tengely terhelés: 1036-1100 kg</li>\n	<li>Hátsó tengely terhelés: 980 kg alatt</li>\n	<li>Figyelem! A beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott! A szett NEM tartalmazza!</li>\n</ul>\n\n<ul>\n	<li>Ez az futóműszett német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-55mm, hátul: 30-55mm között állítható<br />(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n</ul>\n\n<ul>\n	<li>Made In JOM Németország</li>\n</ul>', 'Jom Bochum Skoda Octavia (Typ: NX), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 1036-1100kg) állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-octavia-typ-nx-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-1036-1100kg-allithato-magassagu-futomu'),
(1109, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó alvázának könnyed beállítását az aktuális útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkednek az optimális rugók és lengéscsillapítók közötti tökéletes egyensúlyukkal.\n\n<u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az elismert <strong>Eibach</strong> gyártja</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is</li>\n	<li>Két rétegű bevonattal ellátva a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Rugalmas összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: NX), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-nx-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(1110, '', '<p>Az MTS-Technik által kifejlesztett sport futóművek rugóit az Eibach cég gyártja, melyek fokozatmentesen állíthatók a magasság tekintetében, így könnyedén igazíthatók az útviszonyokhoz. Az MTS-Technik futóművei kiváló összhangot teremtenek a rugók és a lengéscsillapítók között, biztosítva ezzel optimális teljesítményt. A termék TÜV engedéllyel rendelkezik, és a magasság szabadon állítható legtöbb esetben 25 és 80 mm között. Emellett gáztöltésű lengéscsillapítókkal van ellátva, melyek magas hatékonyságot biztosítanak extrém igénybevétel mellett is. A futóművek két rétegű bevonattal rendelkeznek a hosszú távú korrózióvédelem érdekében, valamint tökéletes összhangot biztosítanak a rugók és a lengéscsillapítók között. A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében.</p>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: NX), kivéve Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-nx-kiveve-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(1111, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A fokozatmentesen állítható magasságnak köszönhetően könnyedén szabályozható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik sport futóművei kiemelkedő összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja, garantálva ezzel a kiváló minőséget.</li>\n	<li>A termék rendelkezik TÜV engedéllyel, biztosítva a termék magas színvonalát.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között, így mindenki megtalálhatja az ideális beállítást.</li>\n	<li>A lengéscsillapítók gáztöltésűek, biztosítva a kiváló teljesítményt extrém körülmények között is.</li>\n	<li>A futómű két rétegű bevonattal rendelkezik a hosszú távú korrózióvédelem érdekében.</li>\n	<li>A rugó és lengéscsillapító tökéletes összhangban van egymással, ezáltal biztosítva a kiváló vezetési élményt.</li>\n	<li>A készlet plug & play, így nem igényel módosításokat az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: NX), csak Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-nx-csak-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(1112, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak a vásárlóknak, akik számára fontos a kiváló minőség és az elérhető ár. A fokozatmentesen állítható magasságnak köszönhetően könnyedén szabályozható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Főbb jellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach cég gyártja.</li>\n	<li>A termék rendelkezik TÜV engedéllyel.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Octavia (Typ: NX), csak Multilink futóművel szerelt, 2019.11-től, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-octavia-typ-nx-csak-multilink-futomuvel-szerelt-2019-11-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(1113, '', '<p><strong>Volkswagen Passat B8 Bilstein B14 állítható magasságú futómű</strong></p>\n<ul>\n	<li><strong>Volkswagen Passat B8 különböző motorváltozatokkal</li>\n	<li><strong>Volkswagen Passat B8 Variant különböző motorváltozatokkal</li>\n	<li>Kivéve DCC futóművel szerelt</li>\n	<li>Csak Multilink futóművel</li>\n	<li>55mm szárátmérő</li>\n	<li>Első tengely terhelés: 1200kg alatt</li>\n	<li>Hátsó tengely terhelés: 1253kg alatt</li>\n</ul>\n<p><br />\nBILSTEIN egycsöves rendszer<br />\nUpside-Down technológiával<br />\nVersenysportrugók nagy szilárdságú anyagból készülnek<br />\nÁllítható magasság (a rugótányér és a kontra anya alumíniumból készül)<br />\nVersenysport technológia az utcára, a B14-gyel a BILSTEIN mérnökei ezt az elképzelést valósították meg, ami nagy előnyt jelent. A B14 PSS-nél a jármű magassága, az első és hátsó tengelynél legfeljebb 50 mm-rel csökkenthető, egy meghatározott 20mm-es állítási tartományon belül. A B14 PSS extrém terhelhetőségű egycsöves Upside-Down technológiája gondoskodik minden helyzetben a kiegyensúlyozott menetteljesítményről és a vezetés öröméről.</p>', 'Bilstein Skoda Octavia (Typ: NX), beleértve Kombi, csak Multilink futóművel, 2019.11-től, 55mm szárátmérő, (első tengely terhelés 1200kg alatt), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-skoda-octavia-typ-nx-beleertve-kombi-csak-multilink-futomuvel-2019-11-tol-55mm-szaratmer-els-tengely-terheles-1200kg-alatt-bilstein-b14-allithato-magassagu-futomu'),
(1114, '', '<p>Az MTS-Technik által készített állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az elérhető árakat. A futóművek segítségével könnyedén szabályozható az autó hasmagassága a különböző útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkedő egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja, amelyek általában 25 és 80 mm között szabadon állíthatók.</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is.</li>\n	<li>A tartós korrózióvédelem érdekében két rétegű bevonat található rajta (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással.</li>\n	<li>A készlet könnyen telepíthető (plug & play), nem igényel módosítást az autó felfüggesztésén.</li>\n</ul> \n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Rapid Sedan, 2012.07-2019.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-rapid-sedan-2012-07-2019-12-ig-street-series-allithato-magassagu-futomu'),
(1115, '', '<p><strong>Sportos MTS-Technik állítható magasságú futómű</strong></p>\n<ul>\n	<li><strong>Skoda Roomster:</strong> 1.2 / 1.2TSI / 1.4 / 1.6 / 1.2TDI / 1.4TDI / 1.6TDI / 1.9TDI</li>\n	<li><strong>Első tengely maximális terhelése:</strong> 960kg</li>\n	<li><strong>Hátsó tengely maximális terhelése:</strong> 840kg</li>\n	<li><strong>Elülső ültetési mérték:</strong> 50-90mm</li>\n	<li><strong>Hátsó ültetési mérték:</strong> 50-90mm</li>\n	<li>Kivétel: 3 ponton rögzített toronycsapággyal felszerelt típusok</li>\n</ul>\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. A magasság folyamatosan állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság széles tartományban állítható, általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Kiváló egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A szerelés egyszerű, plug & play rendszerű, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Rapid Spaceback, 2012.07-2019.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-rapid-spaceback-2012-07-2019-12-ig-street-series-allithato-magassagu-futomu'),
(1116, '', '<p>A MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőségű, ugyanakkor megfizethető ár. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén igazítsa az autó hasmagasságát az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság széles határok között változtatható (általában 25 és 80 mm között)</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel változtatást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Skoda Roomster (Typ: 5J), 2006.03-2008.12-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-roomster-typ-5j-2006-03-2008-12-ig-allithato-magassagu-futomu'),
(1117, '', '<strong>Állítható magasságú sport futómű</strong></p> <ul> <li><strong>Skoda Roomster modellekhez</strong>: 1.2 / 1.2TSI / 1.4 / 1.6 / 1.2TDI / 1.4TDI / 1.6TDI / 1.9TDI</li> <li><strong>Első tengely maximális terhelése:</strong> 960kg</li> <li><strong>Hátsó tengely maximális terhelése:</strong> 840kg</li> <li><strong>Elülső ültetés mértéke:</strong> 50-90mm</li> <li><strong>Hátsó ültetés mértéke:</strong> 50-90mm</li> <li>Kivétel a 3 ponton rögzített toronycsapággyal szerelt típusok</li> </ul> <p>Az állítható magasságú sport futóművek ideális választás lehetnek azok számára, akik számára kiemelten fontos a kiváló minőség és az megfizethető ár. A fokozatmentesen állítható magasság lehetővé teszi az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik sport futóműveire jellemző az optimális rugó-lengéscsillapító egyensúly.</p> <p><u>Főbb jellemzők:</u></p> <ul> <li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> <li>A magasság általában 25 és 80 mm között állítható</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Kiváló hatékonyság extrém körülmények között is</li> <li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében: sárga cinkbevonat és fekete anodyzált alumínium alkatrészek</li> <li>Rugó-lengéscsillapító tökéletes összhang</li> <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Skoda Roomster (Typ: 5J), 2009.01-2015.05-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-roomster-typ-5j-2009-01-2015-05-ig-street-series-allithato-magassagu-futomu'),
(1118, '', '<p><strong>Skoda Scala Jom Blueline sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Skoda Scala modellek: 1.0TSI, 1.5TSI, 1.6TDI</li>\\r\\n	<li>Elülső ültetés mértéke: 30-60mm</li>\\r\\n	<li>Hátsó ültetés mértéke: 30-50mm</li>\\r\\n	<li>A futómű TÜV engedéllyel rendelkezik!</li>\\r\\n</ul>\\r\\n\\r\\n<p><em>Az oldalon található szöveges és képi tartalmak másolása, sokszorosítása engedély nélkül tilos!</em></p>', 'Jom Bochum Skoda Scala Hatchback (Typ: NW), 1.0TSi, 1.5TSi, 1.6TDi, 2019.02-től állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-scala-hatchback-typ-nw-1-0tsi-1-5tsi-1-6tdi-2019-02-tol-allithato-magassagu-futomu'),
(1119, '', '<p>Egy kiváló választás azoknak, akik fontosnak tartják a minőséget és az ár-érték arányt. Az MTS-Technik állítható magasságú sport futóművei lehetővé teszik, hogy könnyedén állítsd az autó hasmagasságát az útviszonyoknak megfelelően. A rugókat az Eibach gyártja, és a magasság szabadon állítható 25 és 80 mm között. A gáztöltésű lengéscsillapítók magas hatékonyságot biztosítanak extrém igénybevétel mellett is. A két rétegű bevonat hosszú távú korrózióvédelmet nyújt, míg a tökéletes összhang biztosítja a rugók és a lengéscsillapítók optimális működését. A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</p>', 'MTS-Technik by Nord Performance Skoda Scala Hatchback (Typ: NW), 1.0TSi, 1.5TSi, 1.6TDi, 2019.02-től, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-scala-hatchback-typ-nw-1-0tsi-1-5tsi-1-6tdi-2019-02-tol-street-series-allithato-magassagu-futomu'),
(1120, '', '<strong>Volkswagen Polo 6 Comfort Series MTS-Technik állítható magasságú sport futómű</strong></p>\n<ul>\n    <li><strong>Volkswagen Polo 6 (Typ: AW, BZ)</strong> autókhoz készült futómű</li>\n    <li>Elülső ülésmagasság állítási tartomány: 25-55mm</li>\n    <li>Hátsó ülésmagasság állítási tartomány: 25-50mm</li>\n    <li>Elülső tengely terhelhetőség: 1010kg</li>\n    <li>Hátsó tengely terhelhetőség: 930kg</li>\n    <li>Termék rendelkezik TÜV engedéllyel</li>\n</ul>\n<p>Az állítható magasságú sport futóművek a Volkswagen Polo 6 autókhoz készültek, és ideális választást jelentenek azok számára, akik szeretnék kombinálni a sportos megjelenést az utazási kényelemmel. A futóművek fokozatmentesen állítható magassága lehetővé teszi az könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik Comfort futóművei tökéletes egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között.</p>\n<p><u>Főbb jellemzők:</u></p>\n<ul>\n    <li>A futóművek rugóit az Eibach cég gyártja</li>\n    <li>Speciális Eibach rugók biztosítják a maximális kényelmet</li>\n    <li>A Comfort Series futóművek kialakításakor a hangsúlyt a magas komfortra helyezték</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém igénybevétel esetén is</li>\n    <li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n    <li>Rugó és lengéscsillapító tökéletes együttműködése</li>\n    <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Scala Hatchback (Typ: NW), 1.0TSi, 1.5TSi, 1.6TDi, 2019.02-től, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-scala-hatchback-typ-nw-1-0tsi-1-5tsi-1-6tdi-2019-02-tol-comfort-series-allithato-magassagu-futomu'),
(1121, '', '<strong>Volkswagen Polo 6 Sport Series MTS-Technik állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Volkswagen Polo 6 (Typ: AW, BZ),</strong> 1.0 / 1.0MPi / 1.0TGI / 1.0TSI / 1.5TSI / 2.0GTI / 1.6TDI</li> 	<li>Ültetés mértéke elõl: 25-55mm</li> 	<li>Ültetés mértéke hátul: 25-50mm</li> 	<li>Elsõ tengely terhelés: 1010kg</li> 	<li>Hátsó tengely terhelés: 930kg</li> 	<li>A termék TÜV engedéllyel rendelkezik!</li> </ul>  <p>A <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. A széles ültetési tartomány biztosítja a maximális vezetési élményt.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a sportosság érdekében</li> 	<li>A <strong>Sport Series</strong> célja a szélesebb ültetési tartomány és a fokozott vezetési élmény</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Korrózióvédelem két rétegű bevonattal</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Scala Hatchback (Typ: NW), 1.0TSi, 1.5TSi, 1.6TDi, 2019.02-től, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-scala-hatchback-typ-nw-1-0tsi-1-5tsi-1-6tdi-2019-02-tol-sport-series-allithato-magassagu-futomu'),
(1122, '', '<p>A SKODA Superb JOM BLUE LINE sport futóműve lehetővé teszi az autó magasságának állítását egy speciális kulcs segítségével. A futómű TÜV minősítéssel rendelkezik és magas minőséget képvisel. Az EPS technológiával készült alkatrészek garantálják a tartósságot és a precíz illeszkedést. A szett tartalmaz 4 lengéscsillapítót rugókkal, valamint 1 állítókulcsot a könnyű beállításhoz.</p>', 'Jom Bochum Skoda Superb (Typ: 3T), 2008-tól, BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-superb-typ-3t-2008-tol-blueline-allithato-magassagu-futomu'),
(1123, '', '<p><strong>Volkswagen Passat B7 MTS-Technik Street Series állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p><u>A következő típusokhoz: </u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Sedan,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Variant,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li>Első tengely terhelés: 1100-1180 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1230 kg alatt</li>\\r\\n	<li>Ültetés mértéke elől: 35-70 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-60 mm</li>\\r\\n	<li><strong>A futómű beszereléséhez rövidített stabilizátor szett használata ajánlott! A szett NEM tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár! A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között. </p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>a termék TÜV engedéllyel rendelkezik!</strong></li>\\r\\n	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li>\\r\\n	<li>gáztöltetes lengéscsillapítók</li>\\r\\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3T), beleértve Kombi, 4x4, 2008-2015-ig, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3t-beleertve-kombi-4x4-2008-2015-ig-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(1124, '', '<div><span>Az Ap futómű ideális választás a dinamikus vezetés kedvelőinek, lehetőséget biztosítva a kívánt ültetés milliméteres pontossággal történő beállítására. A sportos irányíthatóság és a kiváló vezetési tulajdonságok ötvözése mellett a maximális ültetési lehetőséget nyújtjuk.</span></div> <div><span>Alumínium rugótányér segítségével a jármű magassága egyénileg beállítható a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság optimalizált kombinációjával optimális teljesítményt biztosítunk.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Kiemelkedő ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Skoda Superb (Typ: 3T) 4x4, beleértve Kombi, 2008-tól, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3t-4x4-beleertve-kombi-2008-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1125, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméterre precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözésével maximális ültetést érhetünk el.</div>  <div>A járműmagasságot egy alumínium rugótányér segítségével lehet egyénileg beállítani a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmóniája egy optimális konfigurációt eredményez.</div>  <ul> 	<li>kiváló minőség, megfizethető áron</li> 	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>kiemelkedő ár/érték arány</li> 	<li>német minőség</li> </ul>', 'AP made by KW Skoda Superb (Typ: 3T), kivéve 4WD, 55mm szárátmérő, 2008.08-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3t-kiveve-4wd-55mm-szaratmer-2008-08-tol-allithato-magassagu-futomu'),
(1126, '', '<div>\n  <p>Ez az állítható magasságú futómű a Skoda Superb Limousine és Kombi modellekhez passzol, kivéve a 4WD változatot. A lengéscsillapító átmérője 50mm.</p>\n  <p>Tipuskód: 3T</p>\n  <p>Típus variáció:</p>\n  <p>Évjárat: 2008.08-tól</p>\n  <p>Tengelyterhelés elöl (kg): 1200</p>\n  <p>Tengelyterhelés hátul (kg): 1250</p>\n  <p>Egyéb kitételek: Csak 50mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</p>\n  <p>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</p>\n  <p>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</p>\n  <p>Plussz ültetés lehetőség elöl: +10 mm, hátul: +0 mm</p>\n  <p>Made In Ap-Fahrwerke Németország</p>\n  <p>Garancia erre a termékre: 2 év</p>\n  <strong>Cikkszáma: GF82-031</strong>\n</div>', 'AP made by KW Skoda Superb (Typ: 3T), kivéve 4WD, 50mm szárátmérő, 2008.08-tól, AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3t-kiveve-4wd-50mm-szaratmer-2008-08-tol-ap-allithato-magassagu-futomu'),
(1127, '', '<p>Egy állítható magasságú Vogtland futómű szett Skoda Superb típushoz, melynek évjárata 2008.08-tól kezdődik. Az ültetés mértéke 15-40 mm, és a lengéscsillapító ház átmérője 50 mm. A maximális tengelyterhelés elöl 1200 kg, míg hátul 1250 kg. Ennek a minőségi futómű szettnek köszönhetően nemcsak javíthatja az autó megjelenését, de maximális vezetési élményt is biztosít. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerének köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek. A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve. Made in Germany! Cikkszám: 968747</p>', 'Vogtland Skoda Superb (Typ: 3T), 2008.08-tól, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-skoda-superb-typ-3t-2008-08-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1128, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN PASSAT</p> <ul>     <li><strong>Évjárat</strong>: 2005.03-tól</li>     <li><strong>Ültetés mértéke:</strong> 35 - 70 / 35 - 70 mm</li>     <li><strong>Típus</strong>: Volkswagen Passat, Typ 3C, 2WD, 4WD, Lim. / Sedan</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (több mint 1105 kg) 1180 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li>     <li> </li> </ul> <p>Az autó megjelenése javításra kerül és maximális vezetési élményt nyújt ezáltal. Az ültetés mértékét a felhasználó saját elképzelése szerint állíthatja be. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p> <p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968560</p>', 'Vogtland Skoda Suberb (Typ: 3T), 2008.08-tól, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-skoda-suberb-typ-3t-2008-08-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1129, '', '<p><strong>Skoda Superb (Typ: 3T) Eibach Pro-Street-S állítható magasságú futómű</strong><br />\n<br />\nAz Eibach a motorsportokban szerzett tapasztalatot ötvözi a Pro-Street-S futóművében. Legyen szó versenypályáról vagy hétköznapi közlekedésről, ez a futómű garantálja a legjobb minőséget és sportos finomítást. A Pro-Street lengéscsillapítók nemesacél technológiával készülnek, a rugótányérok pedig polyamidból, hogy biztosítsák a magasságállítás korrózióállóságát. A fejlesztések és a minőségi anyagok együttesen egy csúcsminőségű terméket eredményeznek.</p>\n\n<p>Tapasztalja meg az új sportos érzést:<br />\n- A progresszívítás optimális technológiát kínál a motorsportokból az utcai használatra.<br />\n- A futómű sportosan komfortos a normál tartományban, de megfelelően kemény a határértékeken.<br />\n- Az autó magassága egyedileg beállítható.<br />\n- Rozsdamentes nemesacél kivitelezés jellemzi.<br />\n- A magasságállítás egy speciális kulccsal, a polyamid rugótányér csavarásával történik.</p>\n\n<p><u>Termékjellemzők:</u><br />\n- Magasságállítás 20-70 mm között.<br />\n- TÜV által ellenőrzött állíthatóság és komplett dokumentáció a könnyű kezelés érdekében.<br />\n- Rugók az ERS versenyprogramból, melyek például a rally VB-n is használatosak.<br />\n- Csúcsminőségű lengéscsillapítók világszerte piacvezető cégtől az Eibach előírásai szerint.<br />\n- DIN ISO/TS 16949</p>', 'Eibach Skoda Superb (Typ: 3T), beleértve Kombi, kivéve 4x4, 2008-tól, 55mm szárátmérő  állítható magasságú futómű', '', '', '', 'eibach-skoda-superb-typ-3t-beleertve-kombi-kiveve-4x4-2008-tol-55mm-szaratmer--allithato-magassagu-futomu'),
(1130, '', '<strong>Skoda Superb (Typ: 3T) Eibach Pro-Street-S állítható magasságú futómû</strong><br />\\r\\n<br />\\r\\n<span><span>Az Eibach Pro-Street-S állítható magasságú futóműve nemesacélból készül, és ötvözi a motorsportban szerzett tapasztalatokat a mindennapi közlekedés sportosabbá tételére.<br />\\r\\nA futóművet úgy tervezték, hogy akár versenypályán, akár közúton használja autóját, mindig optimális teljesítményt nyújtson. A Pro-Street-S lengéscsillapítók nemesacél technológiával készülnek, biztosítva a sportos megjelenést és kiváló minőséget.<br />\\r\\nA rugótányérok polyamidból készülnek a korrózióállóság érdekében, míg a fejlesztési ismeretek és a minőségi anyagok használata garantálja a termék csúcsminőségét.<br />\\r\\nAz állítható magasságú futóművel új sportos élményt tapasztalhat meg, melyet a progresszív technológia, a kiváló komfort és a magasság egyedi beállítási lehetősége jellemez.<br />\\r\\nA futómű jellemzői közé tartozik a 20-70 mm közötti magasságállítási tartomány, az ellenőrzött állíthatóság, valamint a DIN ISO/TS 16949 minősítés.</span></span></p>\\r\\n', 'Eibach  Skoda Superb (Typ: 3T) 4x4, beleértve Kombi, 2008-tól, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'eibach--skoda-superb-typ-3t-4x4-beleertve-kombi-2008-tol-55mm-szaratmer-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1131, '', '<strong>Skoda SuperB JOM BLUE LINE sport futómű állítható magassággal</strong></p>\\r\\n\\r\\n<p>Az autó típuskódja: 3U</p>\\r\\n\\r\\n<p>Gyártási évek: 2002 - 2008</p>\\r\\n\\r\\n<p>A hátsó tengelyen a magasságállító eszköz a rugó alatt található.</p>\\r\\n\\r\\n<p>Elülső tengely terhelése: 1250 kg</p>\\r\\n\\r\\n<p>Hátsó tengely terhelése: 1025 kg</p>\\r\\n\\r\\n<p>Eredet: NÉMETORSZÁG</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német TÜV engedéllyel, amely a csomagolásban található.</p>\\r\\n\\r\\n<p>2 ÉVES TELJESKÖRŰ GARANCIA!!!</p>\\r\\n\\r\\n<p>Kiemelkedő minőségű, rendkívül kedvező áron!!!</p>\\r\\n\\r\\n<p>A csomag tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és 1 db állítókulccsal.</p>\\r\\n', 'Jom Bochum Skoda Superb (Typ: 3U), 2002-2008-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-skoda-superb-typ-3u-2002-2008-ig-blue-line-allithato-magassagu-futomu'),
(1132, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás lehetnek azok számára, akik számára fontos a kiváló minőség és az kedvező ár. Az állítható magasságú futóművek rugóit az Eibach gyártja. Ezek a termékek rendelkeznek TÜV engedéllyel, és a magasságukat általában 25 és 80 mm között lehet változtatni. A futóművek gáztöltésű lengéscsillapítókkal rendelkeznek, és kiváló hatékonyságot biztosítanak extrém igénybevétel mellett is. A bevonatuk két rétegű, sárga cink bevonat és fekete anodyzált alumínium alkatrészekkel, amely hosszú távú korrózióvédelmet nyújt. Az MTS-Technik futóművei tökéletes összhangot teremtenek a rugók és a lengéscsillapítók között, és a készlet plug & play, így nincs szükség módosításokra az autó felfüggesztésében.</p>', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3U), 2001.12-2008.03-ig, (első tengely terhelés 1101-1210kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3u-2001-12-2008-03-ig-els-tengely-terheles-1101-1210kg-allithato-magassagu-futomu'),
(1133, '', '<strong>Volkswagen Passat 3B, 3BG MTS-Technik állítható magasságú sport futómű</strong></p><ul><li>Sedan és Variant</li><li>Kivéve Syncro és 4-Motion</li><li>Első tengely terhelés 1100kg alatt</li></ul><p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz, és beállíthatja az autó hasmagasságát! Az MTS-Technik futóművei a rugók és a lengéscsillapítók között tökéletes egyensúlyt biztosítanak.</p><p><u>Termékjellemzők:</u></p><ul><li>az állítható magasságú futóművek rugóit az Eibach gyártja</li><li>a termék rendelkezik TÜV engedéllyel</li><li>a magasság szabadon állítható általában 25 és 80 mm között</li><li>gáztöltésű lengéscsillapítók</li><li>kiemelkedő hatékonyság extrém igénybevétel esetén is</li><li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li><li>tökéletes összhang rugó és lengéscsillapító között</li><li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li></ul>', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3U), 2001.12-2008.03-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3u-2001-12-2008-03-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1134, '', '<div>\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">A Skoda Superb V-Maxx sport futóművének magassága és keménysége szabályozható.</p>\n</div>', 'V-Maxx Skoda Superb (Typ: 3U), 2002-2008-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-skoda-superb-typ-3u-2002-2008-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1135, '', '<div> <p>Ez a magasságállítható futómű az alábbi Audi A6 típusokhoz passzol:</p>  <ul> 	<li>Audi A6 Limousine, Avant, Első kerék hajtás</li> 	<li>Tipuskód: 4B</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1997.01-től</li> 	<li>Tengelyterhelés elöl (kg): 1100</li> 	<li>Tengelyterhelés hátul (kg): 1185</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!</li> </ul>  <ul> 	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke Németország</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-009</strong></p> </div> ', 'AP made by KW Skoda Superb (Typ: 3U), 2002.02-től, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3u-2002-02-tol-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1136, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómű a következő autótípusba illeszkedik:</p>  <ul> 	<li>Audi A6 Limousine, Avant, Első kerék hajtás</li> 	<li>Tipuskód: 4B</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1997.01-től</li> 	<li>Tengelyterhelés elöl (kg): 1250</li> 	<li>Tengelyterhelés hátul (kg): 1185</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!</li> </ul>  <ul> 	<li>Ez az futóműszett Német nyelvű TÜV engedéllyel van ellátva!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +50 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Made In Ap-Fahrwerke Németország</li> 	<li>Garancia erre a termékre: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-011</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div> ', 'AP made by KW Skoda Superb (Typ: 3U), 2002.02-től, (első tengely terhelés 1101-1210kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3u-2002-02-tol-els-tengely-terheles-1101-1210kg-ig-allithato-magassagu-futomu'),
(1137, '', '<p>A Vogtland állítható magasságú futómű készlet Skoda Superb típushoz, kivéve a szintezős modelleket. Ez a minőségi futómű szett speciális, nagy teljesítményű kétcsoportos lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek. A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve a szintezős vagy torziós futóművel szerelt autók esetében. Gyártó: Vogtland, Made in Germany! Cikkszám: 968355</p>', 'Vogtland Skoda Superb (Typ: 3U), 2002-2008-ig, (első tengely terhelés: 1101-1210kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-superb-typ-3u-2002-2008-ig-els-tengely-terheles-1101-1210kg-allithato-magassagu-futomu'),
(1138, '', '<p>A Vogtland által készített állítható magasságú futómű szett Skoda Superb típushoz, kivéve a szintezős modelleket. Az évjárat 2002-től kezdődik, az ültetés mértéke pedig 35-60 / 35-60 mm lehet. Az elülső tengely maximális terhelése 1100 kg, míg a hátsó tengelyé 1080 kg.</p>\n\n<p>Ez a futómű szett nemcsak javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A beállítások között lehetőség van az ültetés mértékének személyre szabására. A kiváló minőségű futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és első osztályú minőségűek.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, melyek szintezős vagy torziós futóművel vannak ellátva.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968354</p>', 'Vogtland Skoda Superb (Typ: 3U), 2002-2008-ig, (első tengely terhelés: 1100kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-superb-typ-3u-2002-2008-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1139, '', '<p>Egy olyan sport futómű, ami állítható magasságú, és kifejezetten a Skoda Superb Sedan modellekhez lett tervezve. Ideális választás a 1.4 TSI, 1.5 TSI, 1.8 TSI és 1.6 TDI motorokhoz. Ez a futómű elsősorban alacsonyabb első tengelyterhelésű járművekhez ajánlott, melyeknél az első tengely terhelése 1160kg alatt van, míg a hátsó tengely terhelése 1250kg alatt. Az első lengéscsillapító szár átmérője 50/55mm, és az ültetés mértéke elöl 20-60mm, míg hátul 15-35mm lehet. Fontos megjegyezni, hogy jelenleg nincs TÜV engedélye, az engedélyeztetés folyamatban van. Emellett javasolt rövidített stabilizátor rúd használata, bár ezt a készlet nem tartalmazza.</p>\n<p><em>Kérjük, ne másolja vagy sokszorosítsa a weboldal szöveges tartalmát és képeit engedély nélkül!</em></p>', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3V) Sedan, beleértve 4x4, 2015.03-tól, (első tengely terhelés 1160kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3v-sedan-beleertve-4x4-2015-03-tol-els-tengely-terheles-1160kg-alatt-allithato-magassagu-futomu'),
(1140, '', '<p>Egy olyan sport futómű, amely állítható magasságú, és kifejezetten a Skoda Superb Sedan modellekhez tervezett. Ideális választás az alábbi típusokhoz: 1.4 TSI, 1.4 TSI iV, 1.5 TSI, 1.6 TDI, 1.8 TSI, 2.0 TDI, 2.0 TSI. Az első tengely terhelése 1161-1200kg között van, míg a hátsó tengelyén 1250kg alatt. Az első lengéscsillapító szár átmérője 50/55mm. Az ültetés mértéke elöl 20-60mm, míg hátul 15-35mm. Fontos megjegyezni, hogy jelenleg nincs TÜV engedélye, az engedélyeztetés folyamatban van. Emellett javasolt rövidített stabilizátor rúd használata (nem tartalmazza a készlet).</p>\n<p><em>Kérjük, ne másolja vagy sokszorosítsa a weboldal szöveges tartalmait és képeit engedély nélkül!</em></p>', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3V) Sedan, beleértve 4x4, 2015.03-tól, (első tengely terhelés 1161-1200kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3v-sedan-beleertve-4x4-2015-03-tol-els-tengely-terheles-1161-1200kg-allithato-magassagu-futomu'),
(1141, '', '<p><strong>Volkswagen Passat B8 Variant MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>Az alábbi modellekhez ajánlott:</p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat B8 Variant</strong> különböző változatai</li>\\r\\n	<li>Első tengely teherbírása: 1061-1200kg</li>\\r\\n	<li>Hátsó tengely teherbírása: 1250kg alatt</li>\\r\\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\\r\\n	<li>Elülső ültetés: 35-65mm</li>\\r\\n	<li>Hátsó ültetés: 25-75mm</li>\\r\\n	<li>TÜV engedéllyel NEM rendelkezik, engedélyeztetés folyamatban</li>\\r\\n	<li>Rövidített stabilizátor rúd használata ajánlott (nem tartalmazza a készlet)</li>\\r\\n</ul>\\r\\n\\r\\n<p>A Volkswagen Passat B8 Varianthez tervezett MTS-Technik állítható magasságú sport futóművei ideális választások azok számára, akik minőségi és megfizethető megoldást keresnek! Az MTS-Technik futóművei fokozatmentesen állítható magassággal rendelkeznek, így könnyedén igazíthatók az útviszonyokhoz. Az optimális összhang a rugók és a lengéscsillapítók között biztosítja a kiváló teljesítményt.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li>A magasság széles tartományban állítható, általában 25 és 80 mm között</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\\r\\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\\r\\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n\\r\\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3V) Kombi, beleértve 4x4, 2015.03-tól, (első tengely terhelés 1061-1200kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3v-kombi-beleertve-4x4-2015-03-tol-els-tengely-terheles-1061-1200kg-street-series-allithato-magassagu-futomu'),
(1142, '', '<strong>Volkswagen Passat B8 Variant MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>Alkalmas a következő Volkswagen Passat B8 Variant típusokhoz: 1.4TSI / 1.5TSI / 1.8TSI / 2.0TSI / 1.6TDI / 2.0TDI / 1.4TSI 4motion / 2.0TSI 4motion / 2.0TDI 4motion. Az első tengely terhelése 1060kg alatt, míg a hátsó tengely terhelése 1250kg alatt van. Az első lengéscsillapító szár átmérője 50/55mm. Az ültetés mértéke elől 35-65mm, míg hátul 25-75mm. Jelenleg nincs TÜV engedélye, de az engedélyeztetés folyamatban van. Fontos, hogy rövidített stabilizátor rúd használata ajánlott, bár ez nem tartozék a készlethez.</p>\\r\\n\\r\\n<p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik értékelik a jó minőséget és kedvező árat. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei ideális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futóművek rugóit az Eibach gyártja.</li>\\r\\n	<li>A magasság általában 25 és 80 mm között szabadon állítható.</li>\\r\\n	<li>Gáztöltetű lengéscsillapítók.</li>\\r\\n	<li>Magas hatékonyság extrém igénybevétel mellett.</li>\\r\\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében.</li>\\r\\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\\r\\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3V) Kombi, beleértve 4x4, 2015.03-tól, (első tengely terhelés 1060kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3v-kombi-beleertve-4x4-2015-03-tol-els-tengely-terheles-1060kg-alatt-street-series-allithato-magassagu-futomu'),
(1143, '', '<p>Egy olyan futómű, amelyet az autó magassága könnyedén beállítható az útviszonyoknak megfelelően.</p>\n\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akiknek fontos a minőség és az ár-érték arány. Fokozatmentesen állítható magasságának köszönhetően könnyedén igazítható az autó hasmagassága az útviszonyokhoz. A rugók és lengéscsillapítók közötti optimális egyensúly biztosítja a kiváló teljesítményt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes rugó-lengéscsillapító egyensúly</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3V) Sedan, beleértve 4x4, 2015.03-tól, (első tengely terhelés 1060kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3v-sedan-beleertve-4x4-2015-03-tol-els-tengely-terheles-1060kg-alatt-street-series-allithato-magassagu-futomu'),
(1144, '', '<p>Egy olyan futóműről van szó, amelyet az MTS-Technik gyártott, és amely lehetővé teszi az állítható magasságot a Volkswagen Passat B8 Variant számos típusához. Ez a futómű optimális egyensúlyt biztosít a rugók és lengéscsillapítók között, és fokozatmentesen állítható magassággal rendelkezik, így könnyedén alkalmazkodik az útviszonyokhoz. Fontos megjegyezni, hogy jelenleg nincs TÜV engedélye, de az engedélyeztetés folyamatban van. Ajánlott rövidített stabilizátor rudak használata. </p>\n\n<p>Az MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik értékelik a jó minőséget és a megfizethető árat. A futóművek rugóit az Eibach gyártja, a magasság pedig általában 25 és 80 mm között szabadon állítható. A futómű gáztöltésű lengéscsillapítókat tartalmaz, és magas hatékonyságot biztosít extrém igénybevételek esetén is. A bevonatnak köszönhetően hosszú távú korrózióvédelmet nyújt. A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Skoda Superb (Typ: 3V) Sedan, beleértve 4x4, 2015.03-tól, (első tengely terhelés 1061-1200kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-superb-typ-3v-sedan-beleertve-4x4-2015-03-tol-els-tengely-terheles-1061-1200kg-street-series-allithato-magassagu-futomu'),
(1145, '', '<p>Egy olyan futómű, mely lehetővé teszi a sportosan ambiciózus vezetők számára, hogy a kívánt járműmagasságot milliméteres pontossággal állítsák be. Ez a futómű kombinálja a sportos irányíthatóságot és az optimális vezetési viselkedést a maximális ültetéssel.</p>\n\n<p>Az Ap futómű egy alumínium rugótányér segítségével lehetővé teszi a járműmagasság egyéni beállítását a TÜV által engedélyezett tartományban. Ez az összehangolt kombináció sportosságot, kényelmet és biztonságot biztosít a legjobb felépítés érdekében.</p>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>', 'AP made by KW Skoda Superb (Typ: 3V), kivéve Kombi és 4-Motion, 2015.03-tól, 55mm szárátmérő, (első tengely terhelés 1041-1200kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3v-kiveve-kombi-es-4-motion-2015-03-tol-55mm-szaratmer-els-tengely-terheles-1041-1200kg-allithato-magassagu-futomu'),
(1146, '', '<p>A Skoda Superb AP futóműve lehetővé teszi a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ültetést. Ennek eredményeként a futómű kombinálja a sportos irányíthatóságot és az optimális vezetési viselkedést a maximális ültetéssel.</p>\n\n<p>A járműmagasság beállításához egy alumínium rugótányért használnak, amely lehetővé teszi a TÜV által engedélyezett tartományon belül történő egyedi beállítást. Ennek eredményeként a futómű optimális felépítést biztosít, amely összehangolja a sportosságot, a kényelmet és a biztonságot.</p>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>', 'AP made by KW Skoda Superb (Typ: 3V), kivéve Kombi és 4-Motion, 2015.03-tól, 55mm szárátmérő, (első tengely terhelés 1040kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-superb-typ-3v-kiveve-kombi-es-4-motion-2015-03-tol-55mm-szaratmer-els-tengely-terheles-1040kg-alatt-allithato-magassagu-futomu'),
(1147, '', '<p>A Vogtland márka által készített állítható magasságú futómű szett tökéletes választás lehet a Volkswagen Passat B8 tulajdonosok számára. Ennek az autótípusnak az évjárata 2014. novemberétől kezdődik. A futómű ültetésének mértéke 30-55mm között állítható, és a szett passzol a Passat Sedan B8 típusú autókhoz, kivéve a 4-Motion változatokat. Az elülső tengely maximális terhelése 1031-1200kg, míg a hátsó tengely maximális terhelése 1250 kg.</p>\n\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanapság a vezetési élményt is fokozza. A beállítási lehetőségek segítségével személyre szabható az ültetés mértéke. A magas teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>Fontos megjegyezni, hogy ez a termék nem rendelkezik TÜV minősítéssel. Azonban a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>A Vogtland állítható magasságú futómű szett Németországban készült!</p>', 'Vogtland Skoda Superb (Typ: 3V), kivéve Kombi és 4-Motion, 2015.06-tól, (első tengely terhelés 1041-1200kg) állítható magasságú futómű', '', '', '', 'vogtland-skoda-superb-typ-3v-kiveve-kombi-es-4-motion-2015-06-tol-els-tengely-terheles-1041-1200kg-allithato-magassagu-futomu'),
(1148, '', '<p>A Vogtland állítható magasságú futómű szett tökéletes választás a VOLKSWAGEN PASSAT B8 modellekhez. Ez a minőségi futómű kitűnő lehetőséget nyújt arra, hogy testreszabva állítsa be az autó ültetését. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók korrózióvédelme első osztályú.</p> <p>Megfelel az 2014.11-től gyártott Volkswagen Passat Sedan, Typ B8 modellekhez, kivéve a 4-Motion változatokat. Az első tengelyterhelés maximuma 1030 kg, míg a hátsó tengelyterhelés maximuma 1250 kg.</p> <p>A termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát biztosít az ültető rugókra és a lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező vagy torziós futóművet szereltek. Made in Germany!</p>', 'Vogtland Skoda Superb (Typ: 3V), kivéve Kombi és 4-Motion, 2015.06-tól, (első tengely terhelés 1040kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-superb-typ-3v-kiveve-kombi-es-4-motion-2015-06-tol-els-tengely-terheles-1040kg-alatt-allithato-magassagu-futomu'),
(1149, '', '<p>FK-Automotive AK Street Állítható Magasságú Futómû</p>\n\n<ul>\n    <li>Egy olyan futómű, melyet lehet állítani, hogy megfeleljen az igényeidnek</li>\n    <li>Megfelelő Skoda Yeti, 2WD típusú gépjárművekhez (Typ: 5L) 2009.08-tól</li>\n    <li>55 mm-es lengéscsillapító szárral rendelkezik</li>\n</ul>\n\n<ul>\n</ul>\n\n<ul>\n    <li>A futómű magassága elöl és hátul is szabályozható</li>\n    <li>Kiváló minőségű FK-Automotive AK Street állítható futómű</li>\n    <li>A magasságot nagy intervallumban lehet állítani</li>\n    <li>Ez az egyik legjobb alapszintű állítható futómű</li>\n    <li>Jól kidolgozott és tartós</li>\n    <li>Megerősíti a kanyarstabilitást és növeli a vezetési élményt</li>\n    <li>Rendelkezik német nyelvű TÜV engedéllyel</li>\n    <li>Az ültetés mértéke körülbelül: 30-65 mm között állítható</li>\n    <li>Gyártási anyaga: Acél</li>\n</ul>', 'FK-Automotive Skoda Yeti (Typ: 5L), 2WD, 2009.08-tól, 55mm szárátmérő, (első tengely terhelés 1170kg alatt) állítható magasságú futómű', '', '', '', 'fk-automotive-skoda-yeti-typ-5l-2wd-2009-08-tol-55mm-szaratmer-els-tengely-terheles-1170kg-alatt-allithato-magassagu-futomu'),
(1150, '', '<p><strong>Volkswagen Passat B7 MTS-Technik Street Series állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p><u>Alkalmazási terület:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Sedan,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Variant,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li>Első tengely terhelés: 1100-1180 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1230 kg alatt</li>\\r\\n	<li>Ültetés mértéke elöl: 35-70 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-60 mm</li>\\r\\n	<li><strong>A futómű beszereléséhez rövidített stabilizátor szett használata javasolt! A szett nem tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a megfizethető ár! Fokozatmentesen beállítható magasságuk lehetővé teszi, hogy könnyedén alkalmazkodjanak az útviszonyokhoz! Az MTS-Technik futóművei kiváló egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>a termék rendelkezik TÜV engedéllyel!</strong></li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>kiváló hatékonyság extrém igénybevétel esetén is</li>\\r\\n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Skoda Yeti (Typ: 5L), 2009.09-2018-ig, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-skoda-yeti-typ-5l-2009-09-2018-ig-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1151, '', '<p>A Vogtland állítható magasságú futómű szett Skoda Yeti modellekhez készült. Az érvjárat 2009.08-tól, és az ültetés mértéke 45-85 mm. Ez a minőségi futómű szett speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és TÜV minősítéssel rendelkeznek. A gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve a szintezős vagy torziós futóművel szerelt autóknál. Made in Germany!</p>', 'Vogtland Skoda Yeti (Typ: 5L), 2WD, 2009.08-tól, 50mm szárátmérő, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-yeti-typ-5l-2wd-2009-08-tol-50mm-szaratmer-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1152, '', '<p>A Vogtland állítható magasságú futómű készlet Skoda Yeti modellekhez ideális választás. Ezt a kiváló minőségű futóművet kifejezetten az autó megjelenésének javítására és a vezetési élmény maximalizálására tervezték. A futómű beállítását az egyedi igények szerint könnyedén lehet módosítani a megfelelő ültetési mértékek segítségével. A készlet tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók korrózióvédelme kiváló minőségű.</p> <p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég, akinek több mint 100 éves tapasztalata van a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A készlet általában 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeket szintező vagy torziós futóművel láttak el.</p> <p>Made in Germany!</p>', 'Vogtland Skoda Yeti (Typ: 5L), 2WD, 2009.08-tól, 55mm szárátmérő, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-skoda-yeti-typ-5l-2wd-2009-08-tol-55mm-szaratmer-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1153, '', '<p>Egy olyan futóművel rendelkező Skoda Yeti, amelynek beállítható a magassága</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Típus: 5L</li>\\r\\n	<li>Első tengely terhelés: 1110kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 1160kg alatt</li>\\r\\n	<li>Első lengéscsillapító szár átmérője: 50mm</li>\\r\\n	<li>Ültetés mértéke elöl: 45-85mm</li>\\r\\n	<li>Ültetés mértéke hátul: 45-85mm</li>\\r\\n	<li>Kivéve: 4x4</li>\\r\\n	<li>TÜV engedély: <a href=\\\"https://www.ap.de/documents/gaAPGFW80-075-82-015_1070-16.pdf\\\">https://www.ap.de/documents/gaAPGFW80-075-82-015_1070-16.pdf</a></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetőnek arra, hogy precízen beállítsa a kívánt ültetést. A sportos irányíthatóság és optimális vezetési tulajdonságok összekapcsolása maximalizálja az élményt.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével a jármű magassága egyénileg beállítható a TÜV által engedélyezett tartományon belül. A sportosság, a kényelem és a biztonság tökéletes egyensúlyban van ebben az optimális konstrukcióban.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termék megfizethető áron</li>\\r\\n	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Skoda Yeti (Typ: 5L), 2WD, 2009.08-tól, 50mm szárátmérő, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-yeti-typ-5l-2wd-2009-08-tol-50mm-szaratmer-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1154, '', '<p>Egy olyan futómű, amely lehetővé teszi az általad kívánt ültetés milliméteres beállítását. A sportos irányíthatóság és optimális vezetési tulajdonságok egyesítése a maximális ültetéssel.</p>\n\n<p>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatod a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság optimális kombinációjával egy ideális felépítést biztosítunk.</p>\n\n<ul>\n	<li>kiváló minőség megfizethető áron</li>\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>egyedülálló ár/érték arány</li>\n	<li>német minőség</li>\n</ul>', 'AP made by KW Skoda Yeti (Typ: 5L), 2WD, 2009.08-tól, 55mm szárátmérő, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-skoda-yeti-typ-5l-2wd-2009-08-tol-55mm-szaratmer-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1155, '', '<div><strong><span>Toyota GT86 Bilstein B14 állítható magasságúsport futómû</span></strong><br /> <br /> <span>A BILSTEIN egytömegű rendszerrel ellátott futóműve Upside-Down technológiát alkalmaz, versenysportrugókból készült nagy szilárdságú anyagokkal. Az állítható magasságú futómű a rugótányér és a kontra anya alumíniumból készült, lehetővé téve a jármű magasságának szabályozását. A B14 PSS modellel a BILSTEIN mérnökei olyan versenysport technológiát terveztek az utcára, amely lehetővé teszi a jármű magasságának max. 50 mm-rel történő csökkentését mind az első, mind a hátsó tengelyen, egy 20 mm-es állítási tartományon belül. A B14 PSS futómű egycsöves Upside-Down technológiája extrém terhelésre tervezett, biztosítva a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmények között.</span></div>', 'Bilstein Subaru BRZ, 2.0, 2012.06-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-subaru-brz-2-0-2012-06-tol-bilstein-b14-allithato-magassagu-futomu'),
(1156, '', '<div>\\n<p>Egyedi futóművel szerelt Subaru Impreza Kombi, amelynek V-Maxx rendszerével állítható a sport futómű magassága.</p>\\n</div>', 'V-Maxx Subaru Impreza (Typ: GC, GF, GFC) Kombi, 1992.08-2000.12-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-subaru-impreza-typ-gc-gf-gfc-kombi-1992-08-2000-12-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1157, '', '<br />    <div><br />        <strong>Állítható magasságú V-Maxx futómű a Subaru Impreza számára</strong><br />    </div><br />', 'V-Maxx Subaru Impreza (Typ: GC, GF, GFC), beleértve GT-Turbo, kivéve Kombi, 1992.08-2000.12-ig, 20 fokozatban állítható keménység állítható magasságú futómű', '', '', '', 'v-maxx-subaru-impreza-typ-gc-gf-gfc-beleertve-gt-turbo-kiveve-kombi-1992-08-2000-12-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1158, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípusnak:</p>  <ul> 	<li>Subaru Impreza</li> 	<li>Tipuskód: GC, GF, GFC</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1992.08 - 2000.12</li> 	<li>Tengelyterhelés elöl (kg): 900</li> 	<li>Tengelyterhelés hátul (kg): 900</li> 	<li>Egyéb kitételek: A gyári méretű gumi és felnikombináció esetén nyomtávszélesítő felszerelése szükséges!</li> </ul>  <ul> 	<li>Ez a futómű Német TÜV engedéllyel rendelkezik!</li> 	<li>Az engedély által meghatározott ültetés mértéke elől: 40-70 mm, hátul: 40-60 mm között állítható<br /> 	(A futómű ennél nagyobb intervallumban is állítható, azonban a TÜV engedély csak ezekkel az értékekkel érvényes.)</li> 	<li>Extra ültetési lehetőség elől: +35 mm, hátul: +25 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF45-001</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> ', 'AP made by KW Subaru Impreza (Typ: GC, GF, GFC), 1991.08-2000.12-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-subaru-impreza-typ-gc-gf-gfc-1991-08-2000-12-ig-allithato-magassagu-futomu'),
(1159, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a Subaru Impreza típusú autókhoz lett tervezve, az években 1991 és 2000 közötti modellekhez. Ennek a futómű szettnek az ültetés mértéke 40-70 mm elöl és 40-60 mm hátul. Az Impreza típusok közül megfelel a Typ GC, GF, GFC modellekhez. Az elülső és a hátsó tengelyterhelés maximuma egyaránt 900 kg. A futómű engedélyezett és minősített, a hozzá tartozó dokumentáció elérhető a <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW450GF01_1534-10.pdf\\\" target=\\\"_blank\\\">linken</a>.</p>\n\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanapság fejlett vezetési élményt biztosít. Az ültetés mértékét személyes igényeidhez igazíthatod. A futómű szett magas teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>A futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég, több mint 100 éves tapasztalattal a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. Alapesetben a szett tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>A termék \"Made in Germany\" minősítéssel büszkélkedhet, és cikkszáma: 968533.</p>', 'Vogtland Subaru Impreza, (Typ: GC, GF, GFC), 1991.08-2000.12-ig állítható magasságú futómű', '', '', '', 'vogtland-subaru-impreza-typ-gc-gf-gfc-1991-08-2000-12-ig-allithato-magassagu-futomu'),
(1160, '', '<div>\\r\\n<div><strong>Subaru Impreza BILSTEIN B16 PSS9</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A BILSTEIN B16 PSS9 lengéscsillapító egyedi egycsöves rendszerrel rendelkezik, melyet Upside-Down technológiával kombináltak. A versenysportrugók nagy szilárdságú anyagból készültek, és az állítható magasságú futómű rugótányérja és kontra anyája alumíniumból készült.</div>\\r\\n\\r\\n<div>A húzó és nyomófokozat 9 fokozatban egyidejűleg állítható, így lehetőség van a futómű finomhangolására. A B16 PSS9 lengéscsillapítóval a jármű magassága akár 50 mm-rel csökkenthető az első és hátsó tengelynél egy behatárolt 20 mm-es állítási tartományon belül.</div>\\r\\n\\r\\n<div>A beépített állapotban található beállító kerék segítségével 9 karakterisztika változtatható, biztosítva a jármű professzionális beállítását minden szituációban.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A Subaru Impreza (Typ: GC) modellekhez kínált BILSTEIN B16 PSS9 lengéscsillapító kompatibilis a következő változatokkal: 1.5, 1.6 i, 1.6 i 4WD, 1.8 i, 1.8 i 4WD, 2.0 AWD, 2.0 i, 2.0 i 4WD, 2.0 Turbo GT 4WD, 2.2 GX AWD.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső állítási tartomány: 50 mm</div>\\r\\n\\r\\n<div>Hátsó állítási tartomány: 35 mm</div>\\r\\n</div>\\r\\n', 'Bilstein Subaru Impreza (Typ: GC), 1994.03-2000.09-ig, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-subaru-impreza-typ-gc-1994-03-2000-09-ig-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(1161, '', '<div><strong>Subaru Impreza Bilstein B14 állítható magasságú sport futómû</strong></div>\n<div> </div>\n<div>A BILSTEIN által tervezett egycsöves rendszer</div>\n<div>Megfordított technológiával</div>\n<div>Erőteljes versenysport rugók felhasználásával</div>\n<div>Állítható magasságú kialakítás (az alumíniumból készült rugótányér és kontra anya révén)</div>\n<div>A versenysport technológia átültetése az utcai használatba - a B14 PSS modellel a BILSTEIN mérnökei olyan megoldást hoztak létre, amely jelentős előnyt nyújt. A B14 PSS lehetővé teszi a jármű magasságának legfeljebb 50 mm-es csökkentését az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőséget biztosító egycsöves, megfordított technológiája minden helyzetben kiegyensúlyozott vezetési élményt és vezetési örömöt nyújt.</div>\n<div> </div>\n<div>Subaru Impreza (Typ: GD, GG), 1.5, 1.6, 1.6 AWD, 2.0 i, 2.0 i All-wheel Drive, 2.0 i R, 2.0 i WRX AWD, 2.0 WRX STi, 2.0 WRX Turbo, 2.2, 2.5 AWD, 2.5 i All-wheel Drive, 2.5 i WRX, 2.5 WRX STi </div>\n<div> </div>\n<div>Elülső maximális ültetés: 25 - 45 mm</div>\n<div>Hátsó maximális ültetés: 20 - 40 mm</div>', 'Bilstein Subaru Impreza (Typ: GD, GG), 2001.03-tól, (rögzítőfuratok távolsága elöl 65 mm), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-subaru-impreza-typ-gd-gg-2001-03-tol-rogzitfuratok-tavolsaga-elol-65-mm-bilstein-b14-allithato-magassagu-futomu'),
(1162, '', '<div>\n    <p>A Subaru Impreza GF45-002 modeljéhez kifejezetten tervezett állítható futómű lehetővé teszi a magasság szabad beállítását, így optimalizálva a jármű teljesítményét és vezethetőségét. Ez a tuning futómű, mely az AP futóművek széles kínálatában megtalálható, sportos vezetési élményt biztosít. A futómű tuning lehetőséget ad az ültetésre és a gewinde beállításokra is.</p>\n</div>', 'AP made by KW Subaru Impreza (Typ: GD/GG, GGS), beleértve WRX, 2000.12-től, (első tengely terhelés 970kg alatt), AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-subaru-impreza-typ-gdgg-ggs-beleertve-wrx-2000-12-tol-els-tengely-terheles-970kg-alatt-ap-allithato-magassagu-futomu'),
(1163, '', '<div>\n    Az Impreza GF45-004 modellel rendelkezik, mely állítható futóművel van ellátva. Ez a tuning futómű lehetővé teszi az állítható magasságot és a sportosabb vezetési élményt. Az AP futómű egy minőségi futómű, melyet futómű tuningra használnak. A \"gewinde\" lehetőséget biztosít az ültetésre és a futómű testreszabására.\n</div>', 'AP made by KW Subaru Impreza (Typ: GD/GG, GGS), beleértve WRX, 2000.12-2008-ig, (első tengely terhelés 971-990kg-ig), AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-subaru-impreza-typ-gdgg-ggs-beleertve-wrx-2000-12-2008-ig-els-tengely-terheles-971-990kg-ig-ap-allithato-magassagu-futomu'),
(1164, '', '<blockquote>\n<p>Subaru Impreza GF45-004 modellhez állítható futómű, mely lehetővé teszi a magasság szabályozását. Ez a tuning futómű AP márkától származik, és sportfutóműként is ismert. A futómű tuning lehetőséget nyújt az autó ültetésére és a gewinde beállítására.</p>\n</blockquote>', 'AP made by KW Subaru Impreza (Typ: GD, GG, GGS), beleértve WRX, 2002.12-2005.08-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-subaru-impreza-typ-gd-gg-ggs-beleertve-wrx-2002-12-2005-08-ig-allithato-magassagu-futomu'),
(1165, '', '<div><strong>Subaru Impreza Bilstein B14 állítható magasságú sport futómű</strong></div>\n<div> </div>\n<div>A Bilstein B14 egyedülálló egycsöves rendszerrel rendelkezik, melyet Upside-Down technológiával kombináltak. A versenysportrugók nagy szilárdságú anyagból készültek, és állítható magasságot biztosítanak, melyet alumíniumból készült rugótányér és kontra anya segít beállítani.</div>\n<div>A B14 PSS modellel a Subaru Impreza magassága akár 50 mm-rel is csökkenthető az első és hátsó tengelyen belül egy 20 mm-es állítási tartományon belül. Az egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</div>\n<div> </div>\n<div>A Bilstein B14 futóműve kompatibilis a következő Subaru Impreza típusokkal: GD, GG, 1.5, 1.5 AWD, 1.6, 1.6 AWD, 2.0 AWD, 2.0 i, 2.0 i R, 2.0 i WRX AWD, 2.0 WRX STi, 2.0 WRX Turbo, 2.2, 2.5 AWD, 2.5 i All-wheel Drive, 2.5 i WRX, 2.5 WRX STi.</div>\n<div> </div>\n<div>Elülső maximális ültetés: 20 - 40 mm</div>\n<div>Hátsó maximális ültetés: 30 - 40  mm</div>', 'Bilstein Subaru Impreza (Typ: GD, GG), 2000.12-től, (rögzítőfuratok távolsága elöl 75 mm), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-subaru-impreza-typ-gd-gg-2000-12-tol-rogzitfuratok-tavolsaga-elol-75-mm-bilstein-b14-allithato-magassagu-futomu'),
(1166, '', '<strong>Suzuki Swift MTS-Technik Street állítható magasságú sport futómű</strong></p>  \n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik értékelik a kiváló minőséget és az megfizethető árat. A futómű könnyedén állítható a földtani viszonyoknak megfelelően, így biztosítva az optimális hasmagasságot. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>A magasság széles tartományban, általában 25 és 80 mm között állítható</li>  \n	<li>Gáztöltésű lengéscsillapítók</li>  \n	<li>Kiemelkedő hatékonyság extrém igénybevételek mellett is</li>  \n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>  \n	<li>Tökéletes összehang rugó és lengéscsillapító között</li>  \n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>  \n</ul>  \n<p><u>Termék jellemzők:</u></p>  \n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  \n<p><em>A weboldal tartalmának, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Suzuki Splash, 2008-tól, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-suzuki-splash-2008-tol-street-series-allithato-magassagu-futomu'),
(1167, '', '<strong>Állítható magasságú futómű Suzuki Swift V-Maxx modellekhez</strong><br /><ul><br /><li>Az állítható futómű kompatibilis a Suzuki Swift 1.0, 1.2 és 1.4 Sport modellekkel</li><br /><li>Nem ajánlott használat 4WD változatokon</li><br /><li>Az elülső ültetési tartomány 25-55mm között állítható</li><br /><li>A hátsó ültetési tartomány 40-65mm között állítható</li><br /><li>A futómű teljes mértékben megfelel a TÜV előírásainak</li><br /></ul>', 'V-Maxx Suzuki Swift (Typ: AZ), 1.0, 1.2, 1.4 Sport, kivéve 4WD, 2017.01-től állítható magasságú futómű', '', '', '', 'v-maxx-suzuki-swift-typ-az-1-0-1-2-1-4-sport-kiveve-4wd-2017-01-tol-allithato-magassagu-futomu'),
(1168, '', '<p>Egy olyan Suzuki Swift FK-Automotive sport futómű, melynek magassága állítható.</p>\\r\\n\\r\\n<p>Ez a futómű kódja: MZ/EZ</p>\\r\\n\\r\\n<p>Használható: 2005.02 - 2010.10 között</p>\\r\\n\\r\\n<p>A futómű hátsó tengelyénél a magasságállító a rugó felett található.</p>\\r\\n\\r\\n<p>Az első tengely terhelése: 835 kg, míg a hátsó tengelyé: 830 kg</p>\\r\\n\\r\\n<p>Gyártási hely: NÉMETORSZÁG</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik TÜV engedéllyel, mely a csomagolás részét képezi és német nyelven áll rendelkezésre.</p>\\r\\n\\r\\n<p>1 ÉV TELJES KÖRŰ GARANCIA!!!</p>', 'FK-Automotive Suzuki Swift (Typ: EZ/MZ), 2005.02-2010.10-ig állítható magasságú futómű', '', '', '', 'fk-automotive-suzuki-swift-typ-ezmz-2005-02-2010-10-ig-allithato-magassagu-futomu'),
(1169, '', '<br /><div><br /><p><strong>Állítható magasságú sport futómű a Suzuki Swift V-Maxx modellehez</strong></p><br /></div><br /><p>Egy olyan futómű, amely lehetővé teszi a Suzuki Swift V-Maxx modeljének magasságának szabályozását, hogy sportosabb élményt nyújtson a vezetőnek. A futómű egyedi tervezése lehetővé teszi a magasság könnyű beállítását, így testreszabhatóvá válik a vezetés élménye és a teljesítmény.</p>', 'V-Maxx Suzuki Swift (Typ: EZ/MZ), 2005.02-2010.10-ig állítható magasságú futómű', '', '', '', 'v-maxx-suzuki-swift-typ-ezmz-2005-02-2010-10-ig-allithato-magassagu-futomu'),
(1170, '', '<strong>MTS-Technik Street Suzuki Swift állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Suzuki Swift (Típus: EZ, MZ)</strong>, 1.3 / 1.3 LPG / 1.5 / 1.6 / 1.3DDiS</li> 	<li>Első tengely teherbírása: 830 kg</li> 	<li>Hátsó tengely teherbírása: 800 kg</li> 	<li>Első ültetés állíthatósága: 15 - 75 mm</li> 	<li>Hátsó ültetés állíthatósága: 15 - 65 mm</li> 	<li>Első fő rugó rugóerőssége: 50 N/mm</li> 	<li>Első segéd rugó rugóerőssége: 20 N/mm</li> 	<li>Hátsó fő rugó rugóerőssége: 21 - 25 - 30 N/mm</li> 	<li>Nincs TÜV engedélye! Engedélyezés folyamatban!</li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár! A magasság folyamatosan állítható, így könnyedén igazítható az útviszonyokhoz az autó hasmagassága! Az MTS-Technik futóművei tökéletes egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes harmónia a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék jellemzői:</u></p>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és terjesztése tilos!</em></p> ', 'MTS-Technik by Nord Performance Suzuki Swift (Typ: EZ/MZ), 2005.02-2010.10-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-suzuki-swift-typ-ezmz-2005-02-2010-10-ig-street-series-allithato-magassagu-futomu'),
(1171, '', '<div>\\r\\n<p>Ez a magasságállítható futómű a következő Suzuki Swift modellekhez passzol:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Tipuskód: MZ, EZ</li>\\r\\n	<li>Kivéve: 4x4</li>\\r\\n	<li>Évjárat: 2005.05-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 830</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 800</li>\\r\\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>A futómű beállítása elöl 40-75 mm, hátul 40-65 mm között állítható, de ennél nagyobb intervallumban is lehet módosítani. Azonban a TÜV engedély csak a fent említett beállításokra vonatkozik.</li>\\r\\n	<li>Plussz ültetés lehetőség elöl: +15 mm, hátul: +5 mm</li>\\r\\n	<li>A termék Made In Ap-Fahrwerke Németországban készült</li>\\r\\n	<li>2 év garancia vonatkozik erre a termékre</li>\\r\\n</ul>\\r\\n</div>\\r\\n', 'AP made by KW Suzuki Swift (Typ: EZ/MZ), 2005.02-2010.10-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-suzuki-swift-typ-ezmz-2005-02-2010-10-ig-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1172, '', '<p>A <strong>Vogtland</strong> által gyártott állítható magasságú futómű szett ideális választás a SUZUKI SWIFT típusú autókhoz, az EZ és MZ típusokhoz, 2WD kivitelben, az évekre 2005.05-2010-ig. Ennek a futómű szetnek az ültetés mértéke 35-65 mm között állítható, mind elöl, mind hátul. A maximális tengelyterhelés elöl 830 kg, míg hátul 800 kg. A futómű engedélyezett és minősített, részletes információkat a <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW760GF03_1031-12.pdf\\\" target=\\\"_blank\\\">hivatalos dokumentumban</a> találsz.</p>\n\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortérzetet és a fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hosszú távon is kiváló teljesítményt nyújtanak.</p>\n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968186</p>', 'Vogtland Suzuki Swift (Typ: EZ/MZ), 2005.05-2010.10-ig állítható magasságú futómű', '', '', '', 'vogtland-suzuki-swift-typ-ezmz-2005-05-2010-10-ig-allithato-magassagu-futomu'),
(1173, '', '</div>\\n<div>\\n<p><em>Egyedi választás a Suzuki Swift V-Maxx modellhez</em></p>\\n</div>', 'V-Maxx Suzuki Swift (Typ: NZ), 1.2, 1.6 Sport, 1.3DDiS, kivéve 4x4, 2010-2017-ig állítható magasságú futómű', '', '', '', 'v-maxx-suzuki-swift-typ-nz-1-2-1-6-sport-1-3ddis-kiveve-4x4-2010-2017-ig-allithato-magassagu-futomu'),
(1174, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik kiváló minőséget és kedvező árat keresnek. Az útviszonyoknak megfelelően fokozatmentesen beállítható a jármű hasmagassága. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n<u>Termékjellemzők:</u>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u>Termék karakterisztika:</u></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Suzuki Swift (Typ: NZ), 1.2, 1.6 Sport, 1.3DDiS, kivéve 4x4, 2010-2017-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-suzuki-swift-typ-nz-1-2-1-6-sport-1-3ddis-kiveve-4x4-2010-2017-ig-street-series-allithato-magassagu-futomu'),
(1175, '', '<div>\\r\\n<div>Az Ap futómű kiváló lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ülésmagasságot. A sportos irányíthatóságot és optimális vezetési viselkedést a maximális ülésmagassággal kombináljuk.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg be lehet állítani a TÜV által engedélyezett tartományban. A sportosságot, kényelmet és biztonságot optimálisan ötvözzük egymással, ezáltal biztosítva az ideális beállítást.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>Magas minőség, megfizethető áron</li>\\r\\n	<li>Egyedi magasság beállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>Kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>Különleges ár/érték arány</li>\\r\\n	<li>Német minőség</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos tudnivaló! Ebben a futóműben csak a magasság állítható, a keménység nem!</div>\\r\\n</div>\\r\\n', 'AP made by KW Suzuki Swift (Typ: NZ), kivéve 4x4, 2010.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-suzuki-swift-typ-nz-kiveve-4x4-2010-09-tol-allithato-magassagu-futomu'),
(1176, '', '<p>Egy állítható magasságú futómű szett a Suzuki Swift modellekhez az évek 2010-2016 között. Ez a futómű szett lehetővé teszi az ültetés mértékének személyre szabását 30-60mm-el az első tengelyen és 35-65mm-el a hátsó tengelyen. A SUZUKI SWIFT Typ NZ, 2WD típusú autókhoz tervezve, maximális tengelyterhelése elöl és hátul egyaránt 850 kg. \n\nEz a minőségi futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó megjelenésének javításához és a maximális vezetési élményhez.\n\nA termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművet használnak.\n\nMade in Germany!\n\nCikkszám: 968729</p>', 'Vogtland Suzuki Swift (Typ: NZ), 2WD, 2010.09-2016.11-ig állítható magasságú futómű', '', '', '', 'vogtland-suzuki-swift-typ-nz-2wd-2010-09-2016-11-ig-allithato-magassagu-futomu'),
(1177, '', '<div> <div> <p>Az AP-Fahrwerke Állítható magasságú futómű megfelel az alábbi járműtípusnak:</p>  <ul> 	<li>Citroen C1</li> 	<li>Tipuskód: C1</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2005.06-tól</li> 	<li>Tengelyterhelés elöl (kg): 695</li> 	<li>Tengelyterhelés hátul (kg): 695</li> 	<li>Egyéb kitételek: -</li> </ul>  <ul> 	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedély által meghatározott ültetési tartomány elöl: 20-55 mm, hátul: 25-55 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak ezekkel az értékekkel érvényes.)</li> 	<li>Extra ültetési lehetőség elöl: +35 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>2 év garancia a termékre</li> </ul>  <p><strong>Cikkszám: GF95-008</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div> </div>', 'AP made by KW Toyota Aygo (Typ: AB1), 2005.07-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-toyota-aygo-typ-ab1-2005-07-tol-allithato-magassagu-futomu'),
(1178, '', '<p>A Vogtland állítható magasságú futómű szett kifejezetten a Toyota Aygo típushoz lett tervezve, évjáratától függetlenül. Ennek a kitűnő minőségű futómű szetthez tartozik két csőből álló lengéscsillapító, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és dinamikus vezetést biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú élettartamuk garantált.</p>\n<p>Az ültetés mértéke széles határok között állítható, lehetőséget adva a felhasználónak saját elképzeléseinek megvalósítására. A maximális tengelyterhelés elöl és hátul egyaránt 695 kg. A termék TÜV minősítéssel rendelkezik, így biztos lehet benne, hogy megfelel minden szigorú európai előírásnak.</p>\n<p>A Vogtland már több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, és ennek a futómű szetnek a gyártója 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más típusú futóművel vannak felszerelve. </p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968138</p>', 'Vogtland Toyota Aygo (Typ: AB1), 2005.07-től állítható magasságú futómű', '', '', '', 'vogtland-toyota-aygo-typ-ab1-2005-07-tol-allithato-magassagu-futomu'),
(1179, '', '<strong>Toyota Celica T23 MTS-Technik Street állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik fontosnak tartják a kiváló minőséget és az előnyös árakat! A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>A következő modellekhez kompatibilis:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Toyota Celica T23, 1.8 / 1.8 16V / 1.8 16V VT-i / 1.8 16V TS</li>\\r\\n	<li>Elülső ültetés: 25-60mm</li>\\r\\n	<li>Hátsó ültetés: 30-65mm</li>\\r\\n	<li>Elülső fő rugó erőssége: 60 N/mm</li>\\r\\n	<li>Elülső segéd rugó erőssége: 5,66 N/mm</li>\\r\\n	<li>Hátsó fő rugó erőssége: 70 N/mm</li>\\r\\n	<li>Hátsó segéd rugó erőssége: 5,66 N/mm</li>\\r\\n	<li>Elülső tengely terhelése: 960kg</li>\\r\\n	<li>Hátsó tengely terhelése: 945kg</li>\\r\\n	<li>Nem rendelkezik TÜV engedéllyel!</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A rugókat az Eibach gyártja</li>\\r\\n	<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\\r\\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><u><strong>Termék jellemzői:</strong></u></p>\\r\\n\\r\\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\\r\\n\\r\\n<p><em>A honlap szöveges és képi tartalmának engedély nélküli másolása és sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Toyota Celica T23 (Typ: ZZT230), 1999-2005-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-toyota-celica-t23-typ-zzt230-1999-2005-ig-street-series-allithato-magassagu-futomu'),
(1180, '', '<div><strong><span>Toyota GT86 Bilstein B14 állítható magasságúsport futómû</span></strong><br /> <br /> <span>BILSTEIN egycsöves rendszer</span><br /> <span>Az Upside-Down technológia alkalmazása</span><br /> <span>Versenysportrugók kiváló minőségű anyagból</span><br /> <span>Állítható magasságú rendszer alumínium tartályból és csavarkapoccsal</span><br /> <span>A BILSTEIN B14 sportfutóművet olyan versenysport technológiával tervezték meg, amely lehetővé teszi a jármű magasságának akár 50 mm-rel történő csökkentését az első és hátsó tengelyen belül egy 20 mm-es állítási tartományon belül. Az egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott vezetési élményt és a vezetés örömét minden helyzetben a B14 PSS-nél.</span></div>', 'Bilstein Toyota GT86, 2012.03-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-toyota-gt86-2012-03-tol-bilstein-b14-allithato-magassagu-futomu'),
(1181, '', '<div><strong><span>Toyota GT86 BILSTEIN B16 állítható magasságú és keménységű sport futómű</span></strong><br /><br /><span>A BILSTEIN által kifejlesztett egycsöves rendszerrel</span><br /><span>Amely Upside-Down technológiát alkalmaz</span><br /><span>A versenysportrugók magas szilárdságú anyagból készültek</span><br /><span>A futómű állítható magasságot biztosít alumínium rugótányér és kontra anya segítségével</span><br /><span>A húzó és nyomófokozat egyszerre 9 fokozatban szabályozható</span><br /><span>Ez az új futómű a BILSTEIN mérnökeinek köszönhetően új teljesítménykategóriát képvisel! A B16 PSS9 lengéscsillapítónál a jármű magassága az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Beépített állapotban egy beállító kerék segítségével 9 karakterisztika változtatható, biztosítva a jármű professzionális beállítását minden helyzetben.</span></div>', 'Bilstein Toyota GT86, 2012.03-tól, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-toyota-gt86-2012-03-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(1182, '', '<p>Egy olyan futóművet kínálunk, amely állítható magasságú és sportos teljesítményt biztosít a Volkswagen Arteon modellekhez. Ez a futómű ideális választás a 1.5 TSI, 2.0 TSI 140KW és a 2.0 TDI 110KW - 147KW típusokhoz. Csak Multilink futóművel szerelt modellekhez ajánljuk, kivéve a Magnetic Ride Control rendszerrel felszerelteket. A futómű első tengelye terhelhetősége 1160 kg alatt, míg a hátsó tengelyén 1250 kg alatt. Az ültetés mértéke elől 20-60 mm között, míg hátul 15-35 mm között állítható. Fontos tudni, hogy ez a futómű rendelkezik TÜV engedéllyel! Kiemelten fontos, hogy a beszereléshez ajánlott egy állítható hosszúságú stabilizátor szett (kutyacsont), amely nem tartozék a futóműhöz.</p>\\r\\n\\r\\n<p><em>Kérjük, vedd figyelembe, hogy a weboldal teljes tartalmának és képeinek engedély nélküli másolása és sokszorosítása szigorúan tilos!</em></p>', 'Jom Bochum Volkswagen Arteon (Typ: 3H), csak MultiLink futóművel szerelt, 2017-től, (első tengely terhelés 1160kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-arteon-typ-3h-csak-multilink-futomuvel-szerelt-2017-tol-els-tengely-terheles-1160kg-alatt-allithato-magassagu-futomu'),
(1183, '', '<p><strong>Állítható magasságú sport futómű a Volkswagen Arteon Jom Blueline modellekhez</strong></p>\n\n<p><u>Ez a termék alkalmas a következő Volkswagen Arteon típusokhoz:</u></p>\n\n<ul>\n	<li><strong>Volkswagen Arteon:</strong> 2.0 TSI 4Motion (200KW/ 206KW), 2.0 TSI 4Motion R, 2.0 TDI 4Motion (140KW/ 147KW/ 176KW)</li>\n	<li><strong>Csak Multilink futóművel szerelt típusokhoz</strong></li>\n	<li><strong>Kivéve Magnetic Ride Control</strong></li>\n	<li>Első tengely terhelés: 1161-1200 kg</li>\n	<li>Hátsó tengely terhelés: 1250 kg alatt</li>\n	<li>Ültetés mértéke elöl: 20-60 mm</li>\n	<li>Ültetés mértéke hátul: 15-35 mm</li>\n	<li>TÜV engedéllyel rendelkezik!</li>\n	<li>Figyelem! A beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott! A szett NEM tartalmazza!</li>\n</ul>\n\n<p><em>Kérjük, ne másolja és ne sokszorosítsa weboldalunk szöveges tartalmait és képeit engedélyünk nélkül!</em></p>', 'Jom Bochum Volkswagen Arteon (Typ: 3H), csak MultiLink futóművel szerelt, beleértve 4-Motion, 2017-től, (első tengely terhelés 1161-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-arteon-typ-3h-csak-multilink-futomuvel-szerelt-beleertve-4-motion-2017-tol-els-tengely-terheles-1161-1200kg-allithato-magassagu-futomu'),
(1184, '', '<p>Egy olyan futómű, melyet az MTS-Technik állítható magasságú sport futóművei közé sorolhatunk, és kifejezetten a Volkswagen Passat B8 Variant típusokhoz lett tervezve. Az előírt típusok listája magában foglalja többek között a 1.4TSI, 1.4GTE Hybrid, 1.5TSI, 1.8TSI, 2.0TSI, 1.6TDI, 2.0TDI, valamint néhány 4motion változatot is. Fontos tudnivaló, hogy ez a futómű nem rendelkezik még TÜV engedéllyel, az engedélyeztetése jelenleg folyamatban van. A futómű ültetési mértéke elől 35-65 mm, míg hátul 25-75 mm lehet. A termék ideális választás lehet azok számára, akik kiemelten fontosnak tartják a minőséget és az ár-érték arányt.</p>\n\n<p>A futóművek rugóit az Eibach gyártja, és a magasságot általában 25 és 80 mm között lehet szabadon állítani. A futómű gáztöltésű lengéscsillapítókkal rendelkezik, melyek magas hatékonyságot biztosítanak extrém igénybevételek mellett is. A korrózióvédelem érdekében a futómű alkatrészeit két rétegű bevonattal látták el. Fontos még megemlíteni, hogy a futómű plug & play kivitelű, tehát nem igényel semmilyen módosítást az autó felfüggesztésében.</p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Arteon, 1.4eHybrid, 2.0TSi 4-Motion, 2.0TDi 4-Motion, 2017.03-tól, (első tengely terhelés 1200kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-arteon-1-4ehybrid-2-0tsi-4-motion-2-0tdi-4-motion-2017-03-tol-els-tengely-terheles-1200kg-alatt-street-series-allithato-magassagu-futomu'),
(1185, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik a kiváló minőséget és megfizethető árat értékelik! A futóművek fokozatmentesen állíthatók, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimalizált rugó-lengéscsillapító egyensúlyt biztosítanak.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>TÜV engedéllyel rendelkeznek</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében: sárga cink bevonat és fekete anodizált alumínium alkatrészek</li> 	<li>Rugalmasan összehangolt rugó-lengéscsillapító rendszer</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Volkswagen Arteon, 1.5TSi, 2.0TSi, 2.0TDi, csak MultiLink futóművel szerelt, 2017.04-től, (első tengely terhelés 1081-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-arteon-1-5tsi-2-0tsi-2-0tdi-csak-multilink-futomuvel-szerelt-2017-04-tol-els-tengely-terheles-1081-1180kg-allithato-magassagu-futomu'),
(1186, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. A futóművek rugóit az Eibach gyártja, melyek TÜV engedéllyel rendelkeznek. A magasság szabadon állítható általában 25 és 80 mm között. A lengéscsillapítók gáztöltésűek, magas hatékonyságot biztosítanak extrém terhelés mellett is. A két rétegű bevonat (sárga cink és fekete anodyzált alumínium alkatrészek) hosszantartó korrózióvédelmet biztosít. A rugók és a lengéscsillapítók között tökéletes az összhang. A készlet könnyen telepíthető (plug & play), nem igényel módosítást az autó felfüggesztésében.</p>', 'MTS-Technik by Nord Performance Volkswagen Arteon, 1.5TSi, 2.0TSi, 2.0TDi, csak MultiLink futóművel szerelt, 2017.04-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-arteon-1-5tsi-2-0tsi-2-0tdi-csak-multilink-futomuvel-szerelt-2017-04-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1187, '', '<p><strong>Volkswagen Passat B8 Bilstein B14 állítható magasságú futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat B8, </strong>1.4TSi, 1.4TSi 4-Motion, 1.4GTE Hybrid, 1.5TSi, 1.8TSi, 2.0TSi, 2.0TSi 4-Motion, 1.6TDi, 2.0TDi, 2.0TDi 4-Motion</li>\\r\\n	<li><strong>Volkswagen Passat B8 Variant, </strong>1.4TSi, 1.4TSi 4-Motion, 1.4GTE Hybrid, 1.5TSi, 1.8TSi, 2.0TSi, 2.0TSi 4-Motion, 1.6TDi, 2.0TDi, 2.0TDi 4-Motion</li>\\r\\n	<li>Kivéve DCC futóművel szerelt</li>\\r\\n	<li>Csak Multilink futóművel</li>\\r\\n	<li>55mm szárátmérõ</li>\\r\\n	<li>Első tengely terhelés: 1200kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 1253kg alatt</li>\\r\\n</ul>\\r\\n\\r\\n<p><br />\\r\\nBILSTEIN egycsöves rendszer<br />\\r\\nFordított elhelyezésű technológiával<br />\\r\\nVersenysport rugók erős anyagból készültek<br />\\r\\nÁllítható magasság (az rugótányér és a kontra anya alumíniumból készül)<br />\\r\\nVersenysport technológia az utcai használatra, a B14-gyel a BILSTEIN mérnökei ezt az elképzelést valósították meg, ami jelentős előnyt nyújt. A B14 PSS esetében a jármű magassága, az első és hátsó tengelynél maximálisan 50 mm-rel csökkenthető, egy meghatározott 20 mm-es állítási tartományon belül. A B14 PSS extrém terhelhető egycsöves Fordított elhelyezésű technológiája gondoskodik minden helyzetben a kiegyensúlyozott menetképességről és a vezetés öröméről.</p>\\r\\n', 'Bilstein Volkswagen Arteon, beleértve Shooting Brake, csak Multilink futóművel szerelt, 2017.03-tól, 55mm szárátmérő, (első tengely terhelés 1200kg alatt), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-arteon-beleertve-shooting-brake-csak-multilink-futomuvel-szerelt-2017-03-tol-55mm-szaratmer-els-tengely-terheles-1200kg-alatt-bilstein-b14-allithato-magassagu-futomu'),
(1188, '', '<strong>Volkswagen Beetla MTS-Technik Street Series sport futómű</strong></p>  <ul> 	<li><strong>Volkswagen Beetle</strong> számos motorváltozattal rendelhető</li> 	<li><strong>Volkswagen Beetle Cabrio</strong> számos motorváltozattal rendelhető</li> 	<li>2011.04-2019.07 között gyártott modellekhez</li> 	<li>Nem kompatibilis Multilink futóművel</li> 	<li>Elülső ültetés: 35-65mm</li> 	<li>Hátsó ültetés: 40-70mm</li> 	<li>Rugó erősség elöl: 32 N/mm</li> 	<li>Rugó erősség hátul: 27 - 40 - 45 N/mm</li> 	<li>Elülső tengely terhelés: 1090kg</li> 	<li>Hátsó tengely terhelés: 880kg</li> 	<li>TÜV engedélyezett</li> </ul>  <p>Az MTS-Technik Street Series sport futóművei kiváló választás azoknak, akik minőségi és megfizethető terméket keresnek. A fokozatmentesen állítható magasságnak köszönhetően könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóművei optimális összhangot teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú élettartam érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>Plug & play készlet, nem igényel felfüggesztés-módosítást</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p> ', 'MTS-Technik by Nord Performance Volkswagen Beetle, kivéve Multilink futóművel szerelt, 2011.04-2019.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-beetle-kiveve-multilink-futomuvel-szerelt-2011-04-2019-07-ig-street-series-allithato-magassagu-futomu'),
(1189, '', '<div><strong>Volkswagen Beetle AP állítható magasságú futómű</strong></div> <div>Típus: 16</div> <div>Évjárat: 2011.10-től</div> <div>Szárátmérő: 50mm</div> <div>Első tengely terhelés: 1016-1070kg</div> <div>Kivéve Multilink futóművel szerelt</div> <div> </div> <div>Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ülésmagasságot. Az optimális vezethetőség és sportos irányíthatóság kombinációját kínálva maximalizálja az ülésmagasságot.</div> <div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. Az optimális felépítés a sportosságot, kényelmet és biztonságot párhuzamosan összehangolva biztosítja.</div> <ul>     <li>kiváló minőség megfizethető áron</li>     <li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>     <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>     <li>egyedülálló ár/érték arány</li>     <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1016-1070kg), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1016-1070kg-50mm-szaratmer-allithato-magassagu-futomu'),
(1190, '', '<div><strong>Volkswagen Beetle AP állítható magasságú futómű</strong></div> <div>Típus: 16</div> <div>Évjárat: 2011.10-től</div> <div>Szárátmérő: 50mm</div> <div>Első tengely terhelés: 1015kg alatt</div> <div>Kivéve Multilink futóművel szerelt</div> <div> </div> <div>A Volkswagen Beetle AP futóműve ideális választás azoknak, akik sportosan ambiciózus vezetési élményre vágynak. Ez a futómű lehetővé teszi a vezető számára, hogy milliméterre pontosan beállítsa az autó ültetését, így kombinálva a sportos irányíthatóságot az optimális vezetési tulajdonságokkal.</div> <div>Egy alumínium rugótányér segítségével könnyedén beállítható a jármű magassága a TÜV által engedélyezett tartományon belül. Ennek eredményeként a sportosság, kényelem és biztonság tökéletes összhangban vannak, biztosítva az optimális teljesítményt.</div> <ul>     <li>kiváló minőség megfizethető áron</li>     <li>egyedi magasság beállítás a TÜV által engedélyezett tartományban</li>     <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>     <li>egyedülálló ár/érték arány</li>     <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1015kg alatt), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1015kg-alatt-50mm-szaratmer-allithato-magassagu-futomu'),
(1191, '', '<div><strong>Volkswagen Beetle AP állítható futómű</strong></div> <div>Típus: 16</div> <div>Évjárat: 2011.10-től</div> <div>Szárátmérő: 55mm</div> <div>Első tengely terhelés: 1016-1070kg</div> <div>Kivéve Multilink felfüggesztéssel</div> <div> </div> <div>Az AP futómű lehetőséget kínál a sportosan vezetésre vágyóknak, hogy a jármű ültetését milliméterre pontosan beállíthassák. Ezáltal a sportos kormányzást és optimális vezetési tulajdonságokat kombináljuk a maximális ültetéssel.</div> <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. Ennek eredményeként a sportosság, kényelem és biztonság tökéletes harmóniáját érhetjük el.</div> <ul>     <li>kiemelkedő minőség megfizethető áron</li>     <li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>     <li> kiváló minőségű alkatrészek és TÜV tanúsítvány</li>     <li> páratlan ár-érték arány</li>     <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1016-1070kg), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1016-1070kg-55mm-szaratmer-allithato-magassagu-futomu'),
(1192, '', '<div>A Volkswagen Beetle AP állítható magasságú futómű olyan lehetőséget kínál a sportosan ambiciózus vezetőknek, hogy milliméteres pontossággal állítsák be az általuk kívánt ültetést. Ez a futómű sportos irányíthatóságot és optimális vezetési magatartást nyújt, miközben maximális ültetést biztosít.</div> <div>A járműmagasságot egy alumínium rugótányér segítségével lehet az engedélyezett tartományban egyénileg beállítani, biztosítva ezzel a sportosságot, kényelmet és biztonságot. </div> <ul>     <li>kiváló minőség megfizethető áron</li>     <li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>     <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>     <li>egyedülálló ár/érték arány</li>     <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1015kg alatt), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1015kg-alatt-55mm-szaratmer-allithato-magassagu-futomu'),
(1193, '', '<div><strong>Volkswagen Beetle AP állítható magasságú futómű</strong></div> <div>Típus: 16</div> <div>Évjárat: 2011.10-től</div> <div>Szárátmérő: 55mm</div> <div>Első tengely terhelés: 1016-1070kg</div> <div>Csak Multilink futóművel szerelt</div> <div> </div> <div>A Volkswagen Beetle AP futóművének segítségével a vezető testreszabhatja az autó ültetését a kívánt magasságba. Az autó sportos irányíthatóságot és optimális vezetési tulajdonságokat kínál, miközben maximalizálja az ültetést.</div> <div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatja a TÜV által engedélyezett tartományon belül. Ennek eredményeként a sportosság, kényelem és biztonság tökéletes harmóniában lesznek az optimális teljesítmény érdekében.</div> <ul>     <li>Prémium minőség kedvező áron</li>     <li>Egyéni magasságbeállítás TÜV által engedélyezett keretek között</li>     <li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li>     <li>Kiemelkedő ár-érték arány</li>     <li>Német minőség</li> </ul>', 'AP made by KW Volkswagen Beetle (Typ: 16), csak Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1016-1070kg), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-beetle-typ-16-csak-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1016-1070kg-55mm-szaratmer-allithato-magassagu-futomu'),
(1194, '', '<div><strong>Volkswagen Beetle AP állítható magasságú futómű</strong></div> <div>Típus: 16</div> <div>Évjárat: 2011.10-től</div> <div>Szárátmérő: 55mm</div> <div>Első tengely terhelés: 1015kg alatt</div> <div>Csak Multilink futóművel szerelt</div> <div> </div> <div>A Volkswagen Beetle AP futóművének célja, hogy lehetőséget biztosítson a sportosan ambiciózus vezetők számára az ültetés milliméteres pontosságú beállítására. A sportos irányíthatóság és az optimális vezetési jellemzők ötvözése a maximális ültetéssel együtt.</div> <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. Az egyedülálló ár/érték arányú Volkswagen Beetle AP futómű kiváló minőségű alkatrészeket és TÜV tanúsítványt kínál, biztosítva ezzel a német minőséget.</div> <ul>     <li>kiváló minőség megfizethető áron</li>     <li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>     <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>     <li>egyedülálló ár/érték arány</li>     <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Beetle (Typ: 16), csak Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1015kg alatt), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-beetle-typ-16-csak-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1015kg-alatt-55mm-szaratmer-allithato-magassagu-futomu'),
(1195, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: VOLKSWAGEN BEETLE</span></div> <ul>     <li><strong>Évjárat</strong>: 2011.10-tõl</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Beetle, Typ 16, 2WD, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 50 mm </li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1070 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 880 kg</li> </ul> <p>Az autó megjelenése javul és jobb vezetési élményt nyújt. Az ültetés mértékét szabadon állíthatja az egyéni igényeknek megfelelõen. Ez a futómû szett kizárólag kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kényelmet és dinamizmust. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minõsítéssel. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, és 2 év garanciát vállal az ültetõ rugókra és lengéscsillapítókra.</p> <p>A szett általában 4 db ültetõ rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezõs vagy torziós futómûvel rendelkezõ autókat.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968781</p>', 'Vogtland Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1016-1070kg), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1016-1070kg-50mm-szaratmer-allithato-magassagu-futomu'),
(1196, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: VOLKSWAGEN BEETLE</span></div> <ul>     <li><strong>Évjárat</strong>: 2011.10-től</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Beetle, Typ 16, 2WD, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérő 50 mm</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1015 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 880 kg</li> </ul> <p>A termék nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt nyújt. A beállítható ültetési magasság lehetőséget biztosít az egyéni preferenciák szerinti testreszabásra. A futómű szett kiváló minőségű, speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p> <p>Made in Germany!</p> <p>Cikkszám: 968780</p>', 'Vogtland Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1015kg alatt), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1015kg-alatt-50mm-szaratmer-allithato-magassagu-futomu'),
(1197, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: VOLKSWAGEN BEETLE</span></div> <ul>     <li><strong>Évjárat</strong>: 2011.10-tõl</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Beetle, Typ 16, 2WD, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 55 mm </li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1070 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 880 kg</li>     <li><strong>Engedély</strong>:</li> </ul> <p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. Lehetőség van személyre szabni az ültetés mértékét az egyéni igények szerint. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hosszú élettartamot garantálnak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugókészítés terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p> <p>Készült Németországban!</p> <p>Cikkszám: 968779</p>', 'Vogtland Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1016-1070kg), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1016-1070kg-55mm-szaratmer-allithato-magassagu-futomu'),
(1198, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: VOLKSWAGEN BEETLE</span></div> <ul>     <li><strong>Évjárat</strong>: 2011.10-től</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Beetle, Typ 16, 2WD, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 55 mm </li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1015 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 880 kg</li> </ul> <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint beállíthatja. A futómű szett kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968778</p>', 'Vogtland Volkswagen Beetle (Typ: 16), kivéve Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1015kg alatt), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-beetle-typ-16-kiveve-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1015kg-alatt-55mm-szaratmer-allithato-magassagu-futomu'),
(1199, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómű szett</span><span>: VOLKSWAGEN BEETLE</span></div> <ul>     <li><strong>Évjárat</strong>: 2011.10-től</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Beetle, Typ 16, 2WD, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 55 mm</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1070 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 880 kg</li>     <li><strong>Engedély</strong>:</li> </ul> <p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem a vezetési élményt is fokozza. Az ültetés mértékét szabadon állíthatja az egyéni igényei szerint. A futómű szett kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és dinamikus vezetési élményt biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező- vagy torziós futóművet szereltek.</p> <p>Németországban gyártva!</p> <p>Cikkszám: 968777</p>', 'Vogtland Volkswagen Beetle (Typ: 16), csak Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1016-1070kg), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-beetle-typ-16-csak-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1016-1070kg-55mm-szaratmer-allithato-magassagu-futomu'),
(1200, '', '<div><strong>Vogtland</strong><span> állítható magasságú futómû szett</span><span>: VOLKSWAGEN BEETLE</span></div> <ul>     <li><strong>Évjárat</strong>: 2011.10-tõl</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Beetle, Typ 16, 2WD, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 55 mm</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1015 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 880 kg</li>     <li><strong>Engedély</strong>:</li> </ul> <p>A Vogtland állítható magasságú futómű szett nemcsak javítja autója megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetés mértékét az egyéni igények szerint könnyedén beállíthatja. A futómű szett kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek a kiegyensúlyozott komfortérzet és fokozott dinamika érdekében. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 darab ültetőrugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p> <p>Gyártva Németországban!</p> <p>Cikkszám: 968776</p>', 'Vogtland Volkswagen Beetle (Typ: 16), csak Multilink futóművel szerelt, 2011.10-től, (első tengely terhelés 1015kg alatt), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-beetle-typ-16-csak-multilink-futomuvel-szerelt-2011-10-tol-els-tengely-terheles-1015kg-alatt-55mm-szaratmer-allithato-magassagu-futomu'),
(1201, '', '<div><strong><span>Volkswagen Golf 6 Bilstein B14 állítható magasságú futómû</span></strong><br />\\r\\n<br />\\r\\n<span>A BILSTEIN egycsöves rendszerrel rendelkezik</span><br />\\r\\n<span>Olyan technológiával rendelkezik, amely lehetővé teszi a versenysportrugók magas szilárdságú anyagból történő felhasználását</span><br />\\r\\n<span>Az állítható magasságú futómű rugótányérja és kontra anyája alumíniumból készül</span><br />\\r\\n<span>A B14 PSS modellel a jármű magassága az első és hátsó tengelyen legfeljebb 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül</span><br />\\r\\n<span>A B14 PSS futómű Upside-Down technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben</span></div>\\r\\n', 'Bilstein Volkswagen Beetle (Typ: 16), csak Multilink futóművel szerelt, 2011.04-től, 55mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-beetle-typ-16-csak-multilink-futomuvel-szerelt-2011-04-tol-55mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1202, '', '<div>\n<p>Ez a JOM BlueLine Állítható magasságú futómű tökéletesen illeszkedik a következő autóhoz:</p>\n\n<ul>\n	<li>VW Golf 4</li>\n	<li><strong>Kivéve: </strong>4-Motion</li>\n	<li>Tipuskód: 1J</li>\n	<li>Változat: 1.4/ 1.6/ 1.8/ 1.8T/ 2.0/ 2.3 V5/ 2.8 V6/ 1.9SDi/ 1.9TDI</li>\n	<li>Évjárat: 1997 &ndash; 2006</li>\n	<li>Tengelyterhelés elöl (kg): 1020</li>\n	<li>Tengelyterhelés hátul (kg): 1025</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben szereplő lehetséges ültetés mértéke elöl: 35-60mm, hátul: 30-60mm<br />\n	(Számos esetben nagyobb tartományban is állítható a futómű, azonban a TÜV engedély csak a fent említett beállításokat engedélyezi.)</li>\n</ul>\n\n<ul>\n	<li>Készült JOM Németországban</li>\n	<li><strong><u>A TÜV engedély letölthető innen:</u></strong>  <strong><a href=\\\"https://www.jom.de/media/files_public/036d5522be5dee6e7b82e48a13cf4d20/741001%20update%2029082019.pdf\\\"><span>Golf 4 JOMBlueline TÜV engedély</span></a></strong></li>\n</ul>\n\n<p><strong>Cikkszám: 741001</strong></p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>\n\n<p> </p>\n\n<p>A JOM Blueline Állítható magasságú futóműszett kiváló minőségű, autóspecifikus alkatrészekből áll.</p>\n\n<p>A magasságállítás személyre szabható a fent említett paraméterek között.</p>\n\n<p>A rugókeménység és csillapítás az egész beállítási tartományban azonos.</p>\n\n<p>Nagy kanyarstabilitást biztosít, ellenáll a keresztirányú erőknek.</p>\n</div>', 'Jom Bochum Volkswagen Bora, kivéve 4-Motion, 1999.05-2005.11-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-bora-kiveve-4-motion-1999-05-2005-11-ig-blue-line-allithato-magassagu-futomu'),
(1203, '', '<p> A JOM Blueline állítható magasságú sport futómű Volkswagen Golf 4 4-Motion modellhez, beleértve a Variantot is. Az autó évjárata 1998.12 és 2003.11 közötti időszakra tehető. Első tengelyterhelés: 1050 kg, hátsó tengelyterhelés: 1080 kg. A futómű hátsó tengelyén a magasságállító a rugó alatt található. A termék MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Az vásárlás teljes körű, 1 éves garanciával jár. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot az egyszerű beállításhoz.</p>', 'Jom Bochum Volkswagen Bora 4-Motion, beleértve Variant, 1999.05-2005-ig állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-bora-4-motion-beleertve-variant-1999-05-2005-ig-allithato-magassagu-futomu'),
(1204, '', '<strong>Volkswagen Golf 4 4-Motion FK-Automotive sport futómű állítható magassággal</strong></p>\\r\\n\\r\\n<p>A Volkswagen Golf 4 4-Motion, beleértve a Variant modellt<br />\\r\\nGyártási időszak: 1998.12 - 2003.11<br />\\r\\nElülső tengelyterhelés: 1050 kg<br />\\r\\nHátsó tengelyterhelés: 1080 kg<br />\\r\\nA futómű hátsó részén a magasságállító a rugó alatt található.<br />\\nGYÁRTVA NÉMETORSZÁGBAN<br />\\nEz a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.<br />\\n1 ÉVES TELJES GARANCIÁVAL!!!<br />\\nMagas minőség, lenyűgöző áron!!!<br />\\nA készlet tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és 1 db állítókulccsal</p>', 'FK-Automotive Volkswagen Bora 4-Motion, beleértve Variant, 1999.05-2005-ig állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-bora-4-motion-beleertve-variant-1999-05-2005-ig-allithato-magassagu-futomu'),
(1205, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és a versenyképes ár. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>  \n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>  \n	<li>Gáztöltéses lengéscsillapítók</li>  \n	<li>Magas hatékonyság extrém terhelés mellett is</li>  \n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelemért (sárga cink és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>  \n	<li>A készlet plug & play, nem szükséges módosítás az autó felfüggesztésén</li>  \n</ul> ', 'MTS-Technik by Nord Performance Volkswagen Bora, csak 4-Motion, 1999.05-2005-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-bora-csak-4-motion-1999-05-2005-ig-street-series-allithato-magassagu-futomu'),
(1206, '', '<strong>Állítható magasságú sport futómű a Volkswagen Golf 4-hez MTS-Technik Comfort sorozatból</strong></p>  <p><u>Az alábbi típusokhoz ajánlott:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Inkluzív Variant</li> 	<li>Kivéve 4-Motion</li> 	<li>Elülső tengely terhelése: 1030kg</li> 	<li>Hátsó tengely terhelése: 1025kg</li> </ul>  <p>A Volkswagen Golf 4-hez tervezett MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választás azoknak, akik a sportos megjelenés mellett fontosnak tartják az utazási kényelmet is. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Comfort futóművei tökéletes egyensúlyt teremtenek az Eibach gyártotta rugók és lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>Különleges Eibach rugók a maximális kényelemért</li> 	<li>A Comfort sorozat kialakításakor nem az extrém alacsony üléspozícióra, hanem a magas kényelemre helyezték a hangsúlyt</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>Az írásos és képi tartalom engedély nélküli másolása és sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Volkswagen Bora, beleértve Variant, kivéve 4-Motion, 1997.09-2006.09-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-bora-beleertve-variant-kiveve-4-motion-1997-09-2006-09-ig-comfort-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1207, '', '<p><strong>Állítható magasságú sport futómű a Volkswagen Golf 4-hez</strong></p> <p><u>Az alábbi típusokhoz illeszkedik:</u></p> <ul> <li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> <li>Variant modellek</li> <li>Kivéve a 4-Motion változatot</li> <li>Első tengely terhelés: 1030kg</li> <li>Hátsó tengely terhelés: 1025kg</li> </ul> <p>A <strong>MTS-Technik Sport sorozatú állítható magasságú sport futómű</strong> ideális választás azok számára, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> optimális egyensúlyt teremtenek az <strong>Eibach</strong> rugók és az <strong>MTS-Technik lengéscsillapítók</strong> között, ami maximális vezetési élményt biztosít és széles ültetési tartományt kínál.</p> <p><u>Termékjellemzők:</u></p> <ul> <li>A futóművekhez tartozó rugókat az <strong>Eibach</strong> gyártja</li> <li>Speciális <strong>Eibach rugók</strong> a maximális sportteljesítményért</li> <li>A <strong>Sport sorozat</strong> létrehozásakor a fokozott vezetési élmény mellett a szélesebb ültetési tartomány volt a fő szempont</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Magas hatékonyság extrém igénybevétel mellett is</li> <li>Két rétegű bevonat a hosszantartó korrózió ellen (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> <li>Tökéletes összhang rugók és lengéscsillapítók között</li> <li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul> <p><u><strong>Termék jellemzői:</strong></u></p> <p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p> <p><em>A weboldalon található szöveges és képi anyagok jogvédelem alatt állnak, engedély nélküli felhasználásuk tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Bora, beleértve Variant, kivéve 4-Motion, 1997.09-2006.09-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-bora-beleertve-variant-kiveve-4-motion-1997-09-2006-09-ig-sport-series-allithato-magassagu-futomu'),
(1208, '', '<div>Az Ap futómű azoknak ajánl sportosan ambiciózus vezetőknek, akik szeretnék milliméterre pontosan beállítani a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési viselkedést kombináljuk a maximális ültetéssel, így biztosítva a kiváló teljesítményt.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével lehetőség van az egyéni járműmagasság beállítására a TÜV által engedélyezett tartományon belül. A sportosságot, kényelmet és biztonságot párhuzamosan összehangolva optimális felépítést biztosítunk.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek elérhető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár/érték arány</li>\\r\\n	<li>német minőségű termékek</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Bora, kivéve 4-Motion, 1998.11-től, (első tengely terhelés 1020kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-bora-kiveve-4-motion-1998-11-tol-els-tengely-terheles-1020kg-alatt-allithato-magassagu-futomu'),
(1209, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípusnak:</p>\n\n<ul>\n	<li>VW Bora 4WD, Limousine, Kombi 4 és 5 hengeres</li>\n	<li>Tipuskód: 1J</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1999.02-től</li>\n	<li>Tengelyterhelés elöl (kg): 1050</li>\n	<li>Tengelyterhelés hátul (kg): 1080</li>\n	<li>Egyéb kitételek: -</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-50 mm, hátul: 30-50 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +20 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11580031</p>\n\n<p><br />\nAz ár 1 szettre vonatkozik!</p>', 'AP made by KW Volkswagen Bora 4-Motion, 4-5 hengeres, 1999.02-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-bora-4-motion-4-5-hengeres-1999-02-tol-allithato-magassagu-futomu'),
(1210, '', '<p>Egy VOLKSWAGEN BORA-hoz való Vogtland állítható magasságú futómű szett, mely 1999-től használható. Az ültetés mértéke 30-50 / 30-50 mm lehet. Ez a szett kifejezetten a Volkswagen Bora, Typ 1J, 4WD, Lim. / Sedan, Kombi / Station wagon, 6 hengeres modellekhez lett tervezve. Az elő tengely maximális terhelése 1110 kg, míg a hátsó tengelyé 1080 kg. A futómű engedélyének részletei <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF30_1548-10.pdf\" target=\"_blank\">itt</a> találhatók.</p>\n\n<p>Az autó megjelenésének javítása mellett ez a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét saját elképzelésének megfelelően állíthatja be. Az exkluzív futómű szett tartalmazza a nagy teljesítményű, speciális kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek és első osztályú minőségűek.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó, akinek több mint 100 éves tapasztalata van a rugógyártás területén, 2 év garanciát nyújt az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Termék gyártási helye: Németország!</p>\n\n<p>Cikkszám: 968358</p>', 'Vogtland Volkswagen Bora Sedan és Variant 4-Motion, 6-hengeres 1999.05-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-bora-sedan-es-variant-4-motion-6-hengeres-1999-05-tol-allithato-magassagu-futomu'),
(1211, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás lehet a Volkswagen Bora típusú gépjárművek számára. Ez a minőségi futómű szett magas szintű vezetési élményt kínál, miközben javítja az autó megjelenését. Az ültetés mértéke személyre szabható 30-50 mm-es tartományban, így mindenki megtalálhatja a számára tökéletes beállítást. A készlet speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók első osztályú korrózióvédelmet nyújtanak.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Ne feledd, hogy a Vogtland termékei Made in Germany minőségjelzéssel büszkélkedhetnek!</p>\n\n<p>Cikkszám: 968691</p>', 'Vogtland Volkswagen Bora Sedan és Variant, kivéve 4-Motion, 1998.11-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-bora-sedan-es-variant-kiveve-4-motion-1998-11-tol-allithato-magassagu-futomu'),
(1212, '', '<p>A Vogtland állítható magasságú futómű készlet ideális választás a Volkswagen Bora típusú autókhoz, 1999-től. Ez a futómű készlet lehetővé teszi az autó ültetésének 30-55 mm-es módosítását, biztosítva ezzel a maximális vezetési élményt. A készlet tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú.</p>\n\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén. A készlet 2 év garanciát nyújt az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968357</p>', 'Vogtland Volkswagen Bora Sedan és Variant 4-Motion, 4-hengeres 1999.02-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-bora-sedan-es-variant-4-motion-4-hengeres-1999-02-tol-allithato-magassagu-futomu'),
(1213, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómû alkalmas a következő autótípusra:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Volkswagen Golf 4 4-Motion</li>\\r\\n	<li>Tipuskód: 1J</li>\\r\\n	<li>Csak 2.8 V6 4-Motion és R32 4-Motion</li>\\r\\n	<li>Évjárat: 1997.08-2007.12</li>\\r\\n	<li>Beleértve Variant</li>\\r\\n	<li>Egyéb kitételek: Az eredeti méretű gumiabroncsok és felnik kombinációjánál sárvédő szélesítő felszerelése szükséges!<br />\\r\\n	Az 50 mm-nél nagyobb átmérőjű sárvédővel rendelkező modellek esetében javasolt a stabilizátorrúd cseréje! A csere a jobboldali hátsó tengely szabad mozgásának növelését célozza, mivel az eredeti kialakítás nem mindig biztosít elegendő helyet a futómű cseréje után. Az alkatrészek cikkszáma a Xenon fényszórókkal nem rendelkező modellekhez: ZB50-017, Xenon fényszóróval ellátott modellekhez: ZB50-017.</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműkészlet rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedély által meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br />\\r\\n	(Mindig nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fent említett beállításokra vonatkozik.)</li>\\r\\n	<li>Készült Németországban, az Ap-Fahrwerke gyárában</li>\\r\\n	<li>Garancia: 2 év</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Bora, 2.8 V6 4-Motion, beleértve Variant, 1998.12-2005.05-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-bora-2-8-v6-4-motion-beleertve-variant-1998-12-2005-05-ig-allithato-magassagu-futomu'),
(1214, '', '<p>A Bilstein B14 egy állítható magasságú sport futómű, melyet az Upside-Down technológiával és versenysport rugókkal terveztek. Az állítható magasság lehetővé teszi, hogy a jármű magassága akár 50 mm-rel is csökkenthető legyen. A B14 PSS egy egycsöves rendszer, mely kiegyensúlyozott menetteljesítményt és vezetési örömöt nyújt. Az első és hátsó tengelyeknél egy behatárolt 20 mm-es állítási tartomány áll rendelkezésre a maximális hatékonyság érdekében.</p>', 'Bilstein Volkswagen Bora 4-Motion, 1998.12-2005.05-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-bora-4-motion-1998-12-2005-05-ig-bilstein-b14-allithato-magassagu-futomu'),
(1215, '', '<div><strong>VW Golf 4 Bilstein B14 sport futómű állítható magassággal</strong></div>  \n<div> </div>  \n<div>Elülső ültetés: 25 - 45 mm</div>  \n<div>Hátsó ültetés: 20 - 40 mm</div>  \n<div> </div>  \n<div>Elülső tengely terhelhetőség: 1060 kg</div>  \n<div>Hátsó tengely terhelhetőség: 1010 kg</div>  \n<div> </div>  \n<div>Az alkatrész rendelkezik TÜV engedéllyel!</div>  \n<div> </div>  \n<div> </div>  \n<div> </div>  ', 'Bilstein Volkswagen Bora, kivéve 4-Motion, 1998.11-2005.07-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-bora-kiveve-4-motion-1998-11-2005-07-ig-bilstein-b14-allithato-magassagu-futomu'),
(1216, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen szabályozható, így könnyedén állítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és lengéscsillapítók optimális egyensúlyát biztosítják.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Kettős rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK1, 1987-1992-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk1-1987-1992-ig-allithato-magassagu-futomu'),
(1217, '', '<p>A Volkswagen Caddy MK1-hez passzoló MTS-Technik Street állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az kedvező ár-érték arányt. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművek optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>A következő típusra alkalmazható:</u></p>\n<ul>\n	<li><strong>Volkswagen Caddy MK1</strong>, 1.5 / 1.6 / 1.8 / 1.6 D</li>\n	<li>Elülső ültetés: 35-80mm</li>\n	<li>Hátsó ültetés: 50-120mm</li>\n	<li>Elülső tengely terhelés: 785kg</li>\n	<li>Hátsó tengely terhelés: 960kg</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n<p><em>Az oldalon található szöveges és képi tartalom másolása, sokszorosítása kizárólag engedéllyel lehetséges!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Caddy, 1979-1993-ig, hátul nútok segítségével 6 helyzetben állítható, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-1979-1993-ig-hatul-nutok-segitsegevel-6-helyzetben-allithato-street-series-allithato-magassagu-futomu'),
(1218, '', '<strong>Állítható magasságú sport futómű a Volkswagen Caddy MK2-hez</strong></p>  <p>Az MTS-Technik állítható sport futóművei kiváló választás azoknak, akik minőségi és megfizethető megoldást keresnek! A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóművei ideális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>A futómű az alábbi típushoz passzol:</u></p>  <ul> 	<li><strong>Volkswagen Caddy MK2</strong>, 60 1.4 / 1.6 / 1.9 SDI / 1.9 TDI</li> 	<li>Elülső ültetés: 20-90mm</li> 	<li>Hátsó ültetés: 50-120mm</li> 	<li>Elülső tengely terhelhetősége: 930kg</li> 	<li>Hátsó tengely terhelhetősége: 1080kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság többnyire 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Extrém igénybevétel esetén is magas hatékonyság</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Volkswagen Caddy, 1995-2003-ig, hátul nútok segítségével 6 helyzetben állítható, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-1995-2003-ig-hatul-nutok-segitsegevel-6-helyzetben-allithato-street-series-allithato-magassagu-futomu'),
(1219, '', '<p>A Volkswagen Caddy MK3 egy olyan jármű, melyet 2003 és 2015 között gyártottak. Ennek a járműnek a laprugó átszerelő készlete lehetővé teszi a 35-90mm-es ültetést. Fontos megjegyezni, hogy az ár 1 darabra vonatkozik, és 2 darabra van szükség a teljes készlethez.</p>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK3, 2003-2015-ig, ültető szett laprugóhoz állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk3-2003-2015-ig-ultet-szett-laprugohoz-allithato-magassagu-futomu'),
(1220, '', '<strong>Volkswagen Caddy MK3 sport futómű állítható magassággal</strong><br />\\r\\nAz autó évjárata: 2003-2015 közötti időszak<br />\\r\\nAz 4-Motion modell kivételével<br />\\r\\nAz elülső tengely terhelése: 1106-1200 kg között<br />\\r\\nA hátsó tengely terhelése: 1230 kg<br />\\r\\nEz a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomag tartalmaz<br />\\r\\nTeljes körű, 1 éves garanciával!<br />\\r\\nKompatibilis 50 és 55 mm átmérőjű szárral is!<br />\\r\\nMagas minőségű termék, rendkívül kedvező áron!<br />\\r\\nA szett tartalmaz: 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 db állító kulcsot a beállításhoz</p>\\r\\n', 'Jom Bochum Volkswagen Caddy MK3, kivéve 4-Motion, 2003-2015-ig, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-caddy-mk3-kiveve-4-motion-2003-2015-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1221, '', '<strong>Állítható magasságú sport futómű Volkswagen Caddy MK3-hoz</strong><br />\\r\\nAz évjárat 2003-2015 közötti időszakot foglalja magában, kivéve a DSG és 4-Motion modelleket.<br />\\r\\nAz elő tengely terhelése 1105 kg, míg a hátsó tengely terhelése 1230 kg.<br />\\r\\nA futómű rendelkezik német TÜV engedéllyel, melyet a csomagolás tartalmaz.<br />\\r\\nEgy teljes év garanciát vállalunk a termékre!<br />\\r\\nAlkalmas 50 és 55 mm átmérőjű szárral rendelkező modellekhez is!<br />\\r\\nRemek minőségű termék hihetetlenül kedvező áron kapható!<br />\\r\\nA csomag tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 db kulcsot az állításhoz.</p>\\r\\n', 'Jom Bochum Volkswagen Caddy MK3, kivéve 4-Motion és DSG, 2003-2015-ig, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-caddy-mk3-kiveve-4-motion-es-dsg-2003-2015-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1222, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akiknek fontos a kiváló minőség és az előnyös ár. A magasság folyamatosan szabályozható, így könnyen alkalmazkodhat az útviszonyokhoz. Ezeknél a futóműveknél tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>a futóművek rugóit az <strong>Eibach</strong> cég gyártja</li>\\r\\n	<li>a magasság általában 25 és 80 mm között állítható</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>nagyon hatékony extrém körülmények között is</li>\\r\\n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\\r\\n	<li>ideális egyensúly a rugók és lengéscsillapítók között</li>\\r\\n	<li>a készlet könnyen beszerelhető, nem szükséges módosítani az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Caddy MK3, 2004.03-tól, (első tengely terhelés 1106-1190kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk3-2004-03-tol-els-tengely-terheles-1106-1190kg-allithato-magassagu-futomu'),
(1223, '', '<p>Az MTS-Technik által gyártott állítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az előnyös ár! A magasság könnyedén szabályozható a futóművek rugóinak és lengéscsillapítóinak optimális egyensúlyának köszönhetően. Az Eibach által gyártott rugók fokozatmentesen állíthatók, általában 25 és 80 mm között. A futóművek gáztöltésű lengéscsillapítókkal rendelkeznek, és kiváló hatékonyságot biztosítanak extrém igénybevétel esetén is. A két rétegű bevonatnak köszönhetően hosszantartó korrózióvédelemmel rendelkeznek. A futóművek tökéletes összhangot teremtenek a rugók és a lengéscsillapítók között, és a készlet plug & play módon használható, anélkül, hogy módosításokat igényelne az autó felfüggesztésén.</p>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK3, 2004.03-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk3-2004-03-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1224, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az vonzó ár-érték arányt. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága, mivel fokozatmentesen állítható. A futóművekben a rugók és a lengéscsillapítók optimális egyensúlya biztosított.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK3, 2004-2015.04-ig, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk3-2004-2015-04-ig-els-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu'),
(1225, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futómű fokozatmentesen szabályozható magassága lehetővé teszi, hogy könnyedén alkalmazkodjon az útviszonyokhoz, és állítsa az autó hasmagasságát. Az MTS-Technik futóműveinek kialakításában tökéletes egyensúly van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság széles tartományban, általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Optimális egyensúly a rugók és lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel változtatásokat az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK3, 2004-2015.04-ig, (első tengely terhelés 1076-1235kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk3-2004-2015-04-ig-els-tengely-terheles-1076-1235kg-allithato-magassagu-futomu'),
(1226, '', '<br /><div><strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">V-Maxx állítható magasságú sportos futómű a Volkswagen Caddy MK3-hoz</strong></div><br />', 'V-Maxx Volkswagen Caddy MK3, 1.2, 1.4, 1.6, 2.0, 1.6TDi, 1.9TDi, 2.0SDi, kivéve DSG, 4-Motion, Xenon fényszórós típusok, 2004-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk3-1-2-1-4-1-6-2-0-1-6tdi-1-9tdi-2-0sdi-kiveve-dsg-4-motion-xenon-fenyszoros-tipusok-2004-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1227, '', '<div>\\n    <em>A Volkswagen Caddy MK3 V-Maxx sport futómű lehetővé teszi a magasság állítását</em>\\n</div>', 'V-Maxx Volkswagen Caddy MK3, 1.2, 1.4, 1.6, 2.0, 1.6TDi, 1.9TDi, 2.0SDi, kivéve DSG, 4-Motion, Xenon fényszórós típusok, 2004-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk3-1-2-1-4-1-6-2-0-1-6tdi-1-9tdi-2-0sdi-kiveve-dsg-4-motion-xenon-fenyszoros-tipusok-2004-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1228, '', '<p>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be a kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját nyújtjuk, maximalizálva ezzel az ültetés hatékonyságát.</p>  <p>A járműmagasságot egy alumínium rugótányér segítségével lehet egyénileg beállítani a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyesítése optimális felépítést biztosít.</p>  <ul> 	<li>Kiemelkedő minőség elérhető áron</li> 	<li>Egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány garantált</li> 	<li>Különleges ár-érték arány</li> 	<li>Német minőségű termékek</li> </ul>', 'AP made by KW Volkswagen Caddy MK3, 2004.03-tól, 50mm szárátmérő, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk3-2004-03-tol-50mm-szaratmer-els-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu'),
(1229, '', '<div>\n   <p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómű</strong> megfelel a következő autótípusnak:</p>\n   <ul>\n      <li>VW Caddy MK3</li>\n      <li>Kivétel: EcoFuel</li>\n      <li>Első lengéscsillapító átmérője: 55mm</li>\n      <li>Tipuskód: 2K, 2KN</li>\n      <li>Évjárat: 2004.03-tól</li>\n      <li>Tengelyterhelés elöl: 1075 kg</li>\n      <li>Tengelyterhelés hátul: 1300 kg</li>\n      <li>Egyéb információk: Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez. A hátsó futóműn többrészű laprugóval szerelt modelleknél szükséges kicserélni egyrészes laprugóra. Csak gyárilag Xenon nélküli modellekhez alkalmas.</li>\n   </ul>\n   <ul>\n      <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n      <li>Az engedély által meghatározott ültetés mértéke elöl: 50-90 mm, hátul: 60-80 mm között állítható. A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak az említett beállításokra vonatkozik.</li>\n      <li>Plussz ültetés lehetősége elöl: +10 mm, hátul: +0 mm</li>\n   </ul>\n   <ul>\n      <li>Gyártó: AP-Fahrwerke, Németország</li>\n      <li>Garancia: 2 év</li>\n   </ul>\n   <p><strong>Cikkszám: GF80-052</strong></p>\n</div>', 'AP made by KW Volkswagen Caddy MK3, 2004.03-tól, 55mm szárátmérő, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk3-2004-03-tol-55mm-szaratmer-els-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu'),
(1230, '', 'Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára arra, hogy a kívánt ültetést milliméter pontossággal beállítsák. A sportos irányíthatóság és optimális vezetési tulajdonságok ötvözését kínáljuk a maximális ültetéssel együtt.</p>  <p>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtjük meg egy optimális konfigurációval.</p>  <ul> 	<li>kiváló minőségű termékek elérhető áron</li> 	<li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>egyedülálló ár-érték arány</li> 	<li>német minőség és megbízhatóság</li> </ul>', 'AP made by KW Volkswagen Caddy MK3, 2004.03-tól, 55mm szárátmérő, (első tengely terhelés 1076-1235kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk3-2004-03-tol-55mm-szaratmer-els-tengely-terheles-1076-1235kg-allithato-magassagu-futomu'),
(1231, '', '<p>Egy olyan autó, amelyet az évjárat 2003 és 2015 között gyártottak. A laprugó átszerelő készlet lehetővé teszi a 35-90 mm-es ültetést. Az ár 1 darabra vonatkozik, és 2 darabra van szükség!</p>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK4, 2015-től, ültető szett laprugóhoz állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk4-2015-tol-ultet-szett-laprugohoz-allithato-magassagu-futomu'),
(1232, '', '<strong>Volkswagen Caddy MK3 sport futómű állítható magassággal</strong><br />\\r\\nAz autó évjárata: 2003-2015 közötti időszak<br />\\r\\nNem alkalmas DSG és 4-Motion modellekhez<br />\\r\\nAz első tengely terhelése: 1105 kg, míg a hátsó tengely terhelése: 1230 kg<br />\\r\\nA futómű rendelkezik német TÜV engedéllyel, melyet a csomag tartalmaz<br />\\r\\n1 év teljes körű garancia a termékre<br />\\r\\nAlkalmas 50 és 55 mm-es szárátmérőkhöz is<br />\\r\\nKiemelkedő minőség rendkívül versenyképes áron<br />\\r\\nA szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 2 db állítókulcsot a beállításhoz</p>\\r\\n', 'Jom Bochum Volkswagen Caddy MK4, kivéve 4-Motion és DSG, 2015-től, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-caddy-mk4-kiveve-4-motion-es-dsg-2015-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1233, '', '<strong>VW Caddy MK3 állítható magasságú sport futómű</strong><br />\\r\\nAz érintett időszak: 2003-2015<br />\\r\\nKivétel a 4-Motion változat<br />\\r\\nAz első tengely terhelése: 1106-1200 kg<br />\\r\\nA hátsó tengely terhelése: 1230 kg<br />\\r\\nEz a sport futómű rendelkezik német TÜV engedéllyel, melyet a csomag tartalmaz<br />\\r\\n1 ÉV TELJES GARANCIÁVAL!!!<br />\\r\\nAlkalmas 50 és 55 mm átmérőjű szárakhoz is!<br />\\r\\nKiváló minőségű termék, rendkívül kedvező áron!!!<br />\\r\\nA csomag tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és 2 db állítókulccsal</p>\\r\\n', 'Jom Bochum Volkswagen Caddy MK4, kivéve 4-Motion, 2015-től, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-caddy-mk4-kiveve-4-motion-2015-tol-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1234, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. A magasság könnyedén állítható a változó útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális egyensúly van a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>Rugók a <strong>Eibach</strong> gyártásában</li>\n	<li>Magasság fokozatmentesen állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen beszerelhető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk4-1-0-1-2tsi-1-4tsi-1-6tdi-1-6-2-0tdi-2015-05-tol-els-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu'),
(1235, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választást jelentenek azok számára, akik számára fontos a kiváló minőség és az előnyös ár. Az autó hasmagassága könnyedén beállítható a változó útviszonyoknak megfelelően, hiszen a futóművek magassága fokozatmentesen állítható. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális együttműködése biztosított.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n    <li>A rugókat az Eibach gyártja</li>\n    <li>A magasságot általában 25 és 80 mm között lehet szabadon állítani</li>\n    <li>Gáztöltetű lengéscsillapítók</li>\n    <li>Kiemelkedő hatékonyság extrém terhelés mellett is</li>\n    <li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n    <li>Tökéletes összhang rugó és lengéscsillapító között</li>\n    <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, (első tengely terhelés 1076-1235kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk4-1-0-1-2tsi-1-4tsi-1-6tdi-1-6-2-0tdi-2015-05-tol-els-tengely-terheles-1076-1235kg-allithato-magassagu-futomu'),
(1236, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <ul> 	<li>Első tengely teherbírása: 1075 kg</li> 	<li>Hátsó tengely teherbírása: 1300 kg</li> 	<li>Elülső ültetés mértéke: 35-90 mm</li> 	<li>Hátsó ültetés mértéke: 35-65 mm</li> 	<li><strong>FONTOS! Csak olyan típusokhoz használható, amelyek hátul egy darabból álló laprugóval vannak felszerelve! A kétrészes laprugót egy darabra kell átalakítani!</strong></li> 	<li><strong>Ez a futómű rendelkezik TÜV engedéllyel!</strong></li> </ul>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár! A futómű magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz a jármű alvázmagassága. Az MTS-Technik futóműveinek rugalmas és lengéscsillapító rendszere tökéletes harmóniát biztosít egymással.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> cég gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Nagy hatékonyság extrém terhelés esetén is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Rugalmas és lengéscsillapító között tökéletes összhang</li> 	<li>A készlet könnyen telepíthető, nem igényel változtatást az autó felfüggesztésén</li> </ul> ', 'MTS-Technik by Nord Performance Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk4-10-12tsi-14tsi-16tdi-16-20tdi-201505-tol-elso-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu-2'),
(1237, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást jelentenek azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és az előnyös ár-érték arányt. Ennek a futóműnek a magassága folyamatosan szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz, és beállítható az autó hasmagassága. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát kínálják.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach cég gyártja</li>\n	<li>a magasság általában 25 és 80 mm között szabadon állítható</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém terhelés mellett is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, (első tengely terhelés 1076-1235kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-caddy-mk4-10-12tsi-14tsi-16tdi-16-20tdi-201505-tol-elso-tengely-terheles-1076-1235kg-allithato-magassagu-futomu-2'),
(1238, '', '<p>Ez az AP-Fahrwerke Állítható magasságú futómű alkalmas a Volkswagen Caddy MK4 típusú autóhoz.</p>\n<ul>\n	<li>A futómű szárátmérője: 50mm</li>\n	<li>Gyártási év: 2015.05-től</li>\n	<li>Első tengelyterhelés: 1075kg alatt</li>\n	<li>Hátsó tengelyterhelés: 1300kg</li>\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel</li>\n	<li>Az engedélyben meghatározott ültetési lehetőségek: elöl 50-90 mm, hátul 60-80 mm között állítható</li>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia időtartama: 2 év</li>\n</ul>', 'AP made by KW Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, 50mm szárátmérő, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk4-1-0-1-2tsi-1-4tsi-1-6tdi-1-6-2-0tdi-2015-05-tol-50mm-szaratmer-els-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu'),
(1239, '', '<div>\n	<p>Ez az AP-Fahrwerke Állítható magasságú futómű kompatibilis a következő autótípussal:</p>\n	<ul>\n		<li>Volkswagen Caddy MK4</li>\n		<li>Szárátmérő: 55mm</li>\n		<li>Gyártási év: 2015.05-től</li>\n		<li>Tengelyterhelés elülső kerekeken (kg): 1075kg alatt</li>\n		<li>Tengelyterhelés hátsó kerekeken (kg): 1300kg</li>\n		<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel</li>\n		<li>Az engedélyben meghatározott első ültetési magasság: 50-90 mm, hátsó: 60-80 mm között állítható</li>\n		<li>Gyártva Ap-Fahrwerke Németországban</li>\n		<li>2 év garancia a termékre</li>\n	</ul>\n</div>', 'AP made by KW Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, 55mm szárátmérő, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk4-1-0-1-2tsi-1-4tsi-1-6tdi-1-6-2-0tdi-2015-05-tol-55mm-szaratmer-els-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu'),
(1240, '', '<p>Az AP-Fahrwerke Állítható magasságú futóművet Volkswagen Caddy MK4 típusú autókhoz tervezték.</p>\n<p>A futómű szárra való átmérője 55 mm, és az évjáratai 2015.05-től vannak.</p>\n<p>Az első tengelyterhelés 1076-1235 kg között mozog, míg a hátsó tengelyterhelés 1300 kg.</p>\n<p>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</p>\n<p>Az engedélyben meghatározott ültetés mértéke az első tengelyen 50-90 mm, míg a hátsó tengelyen 60-80 mm között állítható.</p>\n<p>A termék Ap-Fahrwerke Németországban készült, és 2 év garanciát vállalnak rá.</p>', 'AP made by KW Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, 55mm szárátmérő, (első tengely terhelés 1076-1235kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk4-1-0-1-2tsi-1-4tsi-1-6tdi-1-6-2-0tdi-2015-05-tol-55mm-szaratmer-els-tengely-terheles-1076-1235kg-allithato-magassagu-futomu'),
(1241, '', '<strong>Volkswagen Caddy MK4 ST X állítható magasságú futómű</strong></p>\n\n<ul>\n	<li>Volkswagen Caddy MK4</li>\n	<li>Szárátmérő: 55mm</li>\n	<li>Évjárat: 2015.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 1075kg alatt</li>\n	<li>Tengelyterhelés hátul (kg): 1300kg</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n</ul>\n\n<p>A ST X sorozatú futóművek kiváló ár-érték aránnyal rendelkeznek, egyedi ültetési lehetőséggel és előre beállított sportos csillapítási jellemzőkkel.</p>\n\n<ul>\n	<li>egyedi ültetési lehetőség a TÜV által jóváhagyott tartományon belül</li>\n	<li>menetes állítási lehetőség az első és hátsó tengelyen (amennyiben technikailag lehetséges)</li>\n	<li>galvanizált lengéscsillapítók rozsdásodás elleni védelemmel</li>\n	<li>teljes megoldás állítható rugótányérrel, versenysport rugókkal és porvédelemmel ellátott felütésgátló elemekkel</li>\n	<li>magas teljesítményű 2-utas lengéscsillapítók kiváló minőségű alkatrészekből a hosszú élettartam érdekében</li>\n</ul>', 'AP made by KW Volkswagen Caddy MK4, 1.0, 1.2TSi, 1.4TSi 1.6TDi, 1.6, 2.0TDi, 2015.05-től, 55mm szárátmérő, (első tengely terhelés 1075kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-caddy-mk4-10-12tsi-14tsi-16tdi-16-20tdi-201505-tol-55mm-szaratmero-elso-tengely-terheles-1075kg-alatt-allithato-magassagu-futomu-2'),
(1242, '', '<em>A Volkswagen Caddy MK5 Cargo V-Maxx állítható magasságú sport futóművel könnyedén feldobhatod kerékjárműd sportosabb megjelenését.</em><br /><ul><br /><li><em>A futómű kompatibilis a Volkswagen Caddy 2.0TDi és 2.0TDi DSG típusokkal.</em></li><br /><li><em>Az állítható futómű átmérője 55mm, mely elől 50-90mm, hátsó részen pedig 50-80mm mértékben ültethető.</em></li><br /><li><em>A futómű telepítéséhez fontos a rövidített stabilizátor rúd (kutyacsont) használata, mely nem tartozék a csomaghoz.</em></li><br /><li><em>A V-Maxx sport futómű Hollandiában készül, és jelenleg zajlik a TÜV engedélyeztetése.</em></li><br /><li><em>Minden V-Maxx gewinde-re 24 hónap garanciát vállalnak.</em></li><br /></ul><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/cargo.jpg\\\" style=\\\"height:400px; width:400px\\\" /></p><br /><p><em>Minden jog fenntartva. Tilos a weboldal szöveges tartalmának és képeinek engedély nélküli másolása vagy sokszorosítása.</em></p>', 'V-Maxx Volkswagen Caddy MK5 Cargo, 2.0TDi, beleértve DSG, 2020.11-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-2-0tdi-beleertve-dsg-2020-11-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1243, '', '<strong>V-Maxx futómű a modern Volkswagen Caddy MK5 Cargohoz</strong><br /><br /><ul><br /><li><strong>Részletek:</strong> 1.5TSi motorral, 1.5TSi DSG változattal</li><br /><li>A szár átmérője: 55mm</li><br /><li>Elülső ültetés állítható 50-90mm között</li><br /><li>Hátsó ültetés állítható 50-80mm között</li><br /><li>A futómű beépítéséhez rövidített stabilizátor rúd (kutyacsont) ajánlott</li><br /><li>V-Maxx futómű, gyártva Hollandiában</li><br /><li>Jelenleg nincs TÜV engedély, az engedélyeztetés folyamatban van</li><br /><li>24 hónap garancia minden V-Maxx rugóra</li><br /></ul><br /><br /><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/cargo.jpg\\\" style=\\\"height:400px; width:400px\\\" /></p><br /><br /><br /><p><em>A weboldal tartalmának és képeinek jogtalan másolása és terjesztése tilos!</em></p><br />', 'V-Maxx Volkswagen Caddy MK5 Cargo, 1.5TSi, beleértve DSG, 2020.11-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-1-5tsi-beleertve-dsg-2020-11-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1244, '', '<strong>Volkswagen Caddy MK5 Cargo V-Maxx állítható magasságú sport futómű</strong><br /><br /><ul><br /><li><strong>VW Caddy, 2.0TDi, 2.0TDi DSG</strong></li><br /><li>A szár átmérője 50 mm.</li><br /><li>Elöl az ültetési mérték 50-90 mm között állítható.</li><br /><li>Hátul az ültetési mérték 50-80 mm között állítható.</li><br /><li>Kérjük, vegye figyelembe, hogy a futómű beépítéséhez ajánlott rövidített stabilizátor rúd (kutyacsont) használata, ez azonban nem része a készletnek.</li><br /><li>A V-Maxx futómű Hollandiában készült.</li><br /><li>Ez a termék nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van.</li><br /><li>24 hónap garancia minden V-Maxx coiloverre.</li><br /></ul><br /><br /><p><img alt=\"\" src=\"https://www.futomushop.hu/images/cargo.jpg\" style=\"height:400px; width:400px\" /></p><br /><br /><p><em>A weboldal tartalmának és képeinek jogtalan másolása vagy sokszorosítása tilos!</em></p><br /><br /><p> </p>', 'V-Maxx Volkswagen Caddy MK5 Cargo, 2.0TDi, beleértve DSG, 2020.11-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-2-0tdi-beleertve-dsg-2020-11-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1245, '', '<strong>Állítható magasságú sport futómű a Volkswagen Caddy MK5 Cargo modellhez</strong><br /><br />Az állítható magasságú sport futómű ideális választás a Volkswagen Caddy MK5 Cargo autókhoz. A futómű szára átmérője 50 mm, míg az elülső ültetési mérték 50-90 mm, a hátsó ültetési mérték pedig 50-80 mm lehet. Fontos, hogy a futómű beépítéséhez rövidített stabilizátor rúd (kutyacsont) ajánlott használata, amely sajnos nem része a készletnek. A V-Maxx termék Hollandiában készül, de fontos megjegyezni, hogy a futómű jelenleg nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van. Minden V-Maxx menetmagasság állító elemre 24 hónapos garancia érvényes. Ne felejtsd, hogy a weboldal szöveges tartalmának és képeinek engedély nélküli másolása vagy sokszorosítása tilos!<br /><br /><img alt=\"\" src=\"https://www.futomushop.hu/images/cargo.jpg\" style=\"height:400px; width:400px\" /><br /><br /><em>Minden jog fenntartva.</em>', 'V-Maxx Volkswagen Caddy MK5 Cargo, 1.5TSi, beleértve DSG, 2020.11-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-1-5tsi-beleertve-dsg-2020-11-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1246, '', '<strong>VW Caddy MK5 Cargo Maxi V-Maxx sport futómű</strong><br /><ul><br /><li>A VW Caddy Cargo Maxi modellhez készült V-Maxx sport futómű</li><br /><li>A futómű jellemzői: 1.5TSi, 1.5TSi DSG motorral, 55mm átmérőjű szárral</li><br /><li>Elülső ültetés: 50-90mm, hátsó ültetés: 50-80mm</li><br /><li>A futómű beépítéséhez ajánlott a stabilizátor rúd rövidítése (kutyacsont), amely nem tartozék a készlethez</li><br /><li>A V-Maxx futómű Hollandiában készült</li><br /><li>Még nem rendelkezik TÜV engedéllyel, de az engedélyeztetés folyamatban van</li><br /><li>24 hónap garancia minden V-Maxx csavarra</li><br /></ul><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/cargo.jpg\\\" style=\\\"height:400px; width:400px\\\" /></p><br /><p><em>A weboldal szöveges és képi anyagának engedély nélküli másolása, sokszorosítása tilos!</em></p><br /><p> </p>', 'V-Maxx Volkswagen Caddy MK5 Cargo Maxi, 1.5TSi, beleértve DSG, 2020.11-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-maxi-1-5tsi-beleertve-dsg-2020-11-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1247, '', '<br /><p><strong>V-Maxx márkájú alacsonyítható sport futómű Volkswagen Caddy MK5 Cargo Maxihoz</strong></p><br /><br /><br /><br /><ul><br /><li><strong>Volkswagen Caddy Cargo Maxi</strong> számára lett kifejlesztve</li><br /><li>Az első keréktengely átmérője: 55mm</li><br /><li>Lehetséges az első ülésmagasság csökkentése 50-90mm-ig</li><br /><li>Lehetséges a hátsó ülésmagasság csökkentése 50-80mm-ig</li><br /><li>Fontos tudni, hogy a futómű telepítéséhez ajánlott rövidített stabilizátor rúd (kutyacsont) használata. Ez nem tartozéka a szetnek!</li><br /><li>A futómű Hollandiában gyártott</li><br /><li>Nincs TÜV engedélye, azonban a jóváhagyási folyamat folyamatban van!</li><br /><li>24 hónapos garancia minden V-Maxx menetes rúdra vonatkozik</li><br /></ul><br /><br /><br /><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/cargo.jpg\\\" style=\\\"height:400px; width:400px\\\" /></p><br /><br /><br /><br /><p><em>A honlapon található szöveges és képi anyagok szerzői jogvédelem alatt állnak, engedély nélküli felhasználásuk tilos!</em></p><br />', 'V-Maxx Volkswagen Caddy MK5 Cargo Maxi, 2.0TDi, beleértve DSG, 2020.11-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-maxi-2-0tdi-beleertve-dsg-2020-11-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1248, '', '<strong>Volkswagen Caddy MK5 Cargo Maxi V-Maxx állítható magasságú sport futómű</strong><br /><br /><ul><br /><li><strong>Volkswagen Caddy Cargo Maxi, </strong>1.5TSi, 1.5TSi DSG</li><br /><li>Szár átmérője: 50mm</li><br /><li>Elülső ültetés mértéke: 50-90mm</li><br /><li>Hátsó ültetés mértéke: 50-80mm</li><br /><li>Fontos! A futómű beépítéséhez ajánlott használni egy rövidített stabilizátor rudat (kutyacsont), amely nem része a készletnek!</li><br /><li>A V-Maxx Hollandiában készült</li><br /><li>Nincs TÜV engedélye, az engedélyeztetés folyamatban van!</li><br /><li>24 hónap garancia minden V-Maxx gewinden</li><br /></ul><br /><br /><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/cargo.jpg\\\" style=\\\"height:400px; width:400px\\\" /></p><br /><br /><p><em>A weboldalban található szöveges és képi tartalmak engedély nélküli másolása és sokszorosítása tilos!</em></p><br /><br /><p> </p>', 'V-Maxx Volkswagen Caddy MK5 Cargo Maxi, 1.5TSi, beleértve DSG, 2020.11-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-maxi-1-5tsi-beleertve-dsg-2020-11-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1249, '', '<strong>Volkswagen Caddy MK5 Cargo Maxi V-Maxx állítható magasságú sport futómű</strong>\\n<ul>\n  <li><strong>Volkswagen Caddy Cargo Maxi</strong> modell 2.0TDi és 2.0TDi DSG motorral</li>\n  <li>Szár átmérője: 50mm</li>\n  <li>Elülső ültetés mértéke: 50-90mm</li>\n  <li>Hátsó ültetés mértéke: 50-80mm</li>\n  <li>Kiemelt figyelem: Az optimális beépítés érdekében javasolt rövidített stabilizátor rúd (kutyacsont) használata. A szett nem tartalmazza ezt az alkatrészt!</li>\n  <li>A V-Maxx futómű Hollandiában készült</li>\n  <li>A termék jelenleg nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van</li>\n  <li>24 hónapos garancia minden V-Maxx gewinde-re</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/cargo.jpg\" style=\"height:400px; width:400px\" /></p>\n<p><em>A weboldal szöveges anyagának és képeinek jogtiszta másolása vagy felhasználása engedélyhez kötött!</em></p>\n<p></p>', 'V-Maxx Volkswagen Caddy MK5 Cargo Maxi, 2.0TDi, beleértve DSG, 2020.11-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-caddy-mk5-cargo-maxi-2-0tdi-beleertve-dsg-2020-11-tol-50mm-szaratmer-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1250, '', '<p><strong>MTS-Technik állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n\\t<li><strong>Volkswagen Golf 3 Cabrio, </strong>1.6 / 1.8 / 1.9 TDI / 2.0</li>\\r\\n\\t<li><strong>Volkswagen Golf 4 Cabrio, </strong>1.6 / 1.8 / 1.9 TDI / 2.0</li>\\r\\n\\t<li>Ültetés mértéke elõl: 25-80mm</li>\\r\\n\\t<li>Ültetés mértéke hátul: 25-80m</li>\\r\\n\\t<li>Rugó erõsség (elsõ, fõ rugó): 60 N/mm</li>\\r\\n\\t<li>Rugó erõsség (elsõ, segéd rugó): 20 N/mm</li>\\r\\n\\t<li>Rugó erõsség (hátsó, fõ rugó): 60 N/mm</li>\\r\\n\\t<li>Rugó erõsség (hátsó, segéd rugó): 20 N/mm</li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás lehet azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Az útviszonyoknak megfelelően fokozatmentesen szabályozható az autó hasmagassága, így könnyedén alkalmazkodhat az adott körülményekhez. Az MTS-Technik futóművei a rugók és lengéscsillapítók optimális egyensúlyát nyújtják.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n\\t<li>Ez a futómű TÜV engedéllyel rendelkezik</li>\\r\\n\\t<li>A magasság többnyire 25 és 80 mm között szabadon állítható</li>\\r\\n\\t<li>Gáztöltéses lengéscsillapítók</li>\\r\\n\\t<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li>\\r\\n\\t<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n\\t<li>Tökéletes összhang a rugó és a lengéscsillapító között</li>\\r\\n\\t<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Corrado, 1991-1997-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-corrado-1991-1997-ig-allithato-magassagu-futomu'),
(1251, '', '<div><strong>VW Corrado Vogtland állítható magasságú sport futómű</strong></div> <div> </div> <div><span>Elöl csökkenthető magasság: 40-70mm</span><br /> <br /> <span>Hátul csökkenthető magasság: 40-70mm</span><br /> <br /> <span>Maximális teherbírás (elülső/hátsó tengely): 950 kg / 710 kg</span><br /> <br /> <span>Az alkatrész rendelkezik TÜV tanúsítvánnyal!</span></div>', 'Vogtland Volkswagen Corrado, 1988.10-1995.07-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-corrado-1988-10-1995-07-ig-allithato-magassagu-futomu'),
(1252, '', '<div>Az Ap futómű kialakítása lehetővé teszi a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be a kívánt ültetést. Az optimális vezetési magatartás és a sportos irányíthatóság összekapcsolása maximalizálja az élményt.</div>\\r\\n\\r\\n<div>A járműmagasság egyénileg állítható egy alumínium rugótányér segítségével, mindemellett a beállítás marad az engedélyezett tartományon belül, amit a TÜV is jóváhagyott. Ezáltal a sportosság, kényelem és biztonság tökéletes harmóniája biztosított.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyedi magasságbeállítás a TÜV által jóváhagyott tartományon belül</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány garantálja a megbízhatóságot</li>\\r\\n	<li>kiemelkedő ár-érték arány</li>\\r\\n	<li>német minőség és precizitás</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos! Ebben a futóműben csak a jármű magassága állítható, a keménység beállítása nem lehetséges!</div>\\r\\n', 'AP made by KW Volkswagen Corrado, 1988.10-1995.07-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-corrado-1988-10-1995-07-ig-allithato-magassagu-futomu'),
(1253, '', '<p>Az alkatrész megfelel a következő autótípusnak:</p>\n\n<ul>\n	<li>VW EOS</li>\n	<li>Típuskód: 1F</li>\n	<li>Évjárat: 2006 -tól</li>\n	<li>FONTOS! A futómű beszereléséhez rövidített stabilizátor rúdra van szükség (kutyacsont), mely nem része ennek a szettnek!</li>\n	<li>Tengelyterhelés elöl: 1106 - 1200 kg</li>\n	<li>Tengelyterhelés hátul: 1250 kg</li>\n</ul>\n\n<ul>\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\n	<li>A futómű rendelkezik <strong>TÜV</strong> engedéllyel, melyet a csomag tartalmazza.</li>\n	<li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\n	<li>A szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</li>\n</ul>', 'Jom Bochum Volkswagen Eos (Typ: 1F), 2004-2013.05-ig, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-eos-typ-1f-2004-2013-05-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1254, '', 'Az alkatrész kompatibilis a következő VW EOS autótípushoz, típuskódja 1F, évjárata 2006-tól. Fontos! A futómű beszereléséhez rövidített stabilizátor rúdra (kutyacsont) van szükség, ez nem tartozék a szetthez! Az autó tengelyterhelése elöl 1105 kg-ig, hátul 1250 kg. A futómű MADE IN GERMANY, rendelkezik TÜV engedéllyel, mely a csomagban megtalálható. 2 ÉV TELJESKÖRŰ GARANCIÁVAL! Kiemelkedő minőség, rendkívül kedvező áron! A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal és 1 db állítókulccsal.', 'Jom Bochum Volkswagen Eos (Typ: 1F), 2004-2013.05-ig, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-eos-typ-1f-2004-2013-05-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1255, '', '<p>Az MTS-Technik által készített sport futóművek ideális választás lehet azok számára, akik kiváló minőséget szeretnének megfizethető áron. Az állítható magasságú futóművek lehetővé teszik az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiváló egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Kiemelkedő tulajdonságok:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>Az állítható magasság általában 25 és 80 mm között szabadon beállítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangja</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Eos (Typ: 1F), 2004-2013.05-ig, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-eos-typ-1f-2004-2013-05-ig-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu'),
(1256, '', '<p>Audi A3 MTS-Technik állítható magasságú sport futómű</p><p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveinek rugói az Eibach által gyártottak, melyek lehetővé teszik a magasság szabadon állíthatóságát általában 25 és 80 mm között. A futóművek gáztöltésű lengéscsillapítókkal vannak ellátva, melyek magas hatékonyságot biztosítanak extrém igénybevétel mellett is. A futóművek két rétegű bevonattal rendelkeznek a hosszantartó korrózióvédelem érdekében. Az összhang a rugók és a lengéscsillapítók között tökéletes, míg a készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</p><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Eos (Typ: 1F), 2004-2013.05-ig, (első tengely terhelés 1036-1170kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-eos-typ-1f-2004-2013-05-ig-els-tengely-terheles-1036-1170kg-street-series-allithato-magassagu-futomu'),
(1257, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport futóművek tökéletes összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel a maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p>Az alábbi típusokhoz ajánlott:</p>\n<ul>\n	<li>Audi A3 (Typ: 8P)</li>\n	<li>Audi A3 Sportback (Typ: 8P)</li>\n	<li>Audi A3 Cabrio (Typ: 8P)</li>\n	<li>Első tengely terhelés: 1035kg alatt</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n	<li>Ültetés mértéke elöl: 35-70mm</li>\n	<li>Ültetés mértéke hátul: 35-60mm</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében</li>\n	<li>A Sport Series létrehozása során a fokozott vezetési élmény volt a cél</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Eos (Typ: 1F), 2004-2013.05-ig, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-eos-typ-1f-2004-2013-05-ig-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(1258, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem akarnak engedményeket kötni. A magasság fokozatmentesen állítható az útviszonyoknak megfelelően. Az MTS-Technik Sport futóműveinek Eibach rugói és MTS-Technik lengéscsillapítói optimális összhangban vannak egymással, biztosítva a maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p>A termék alkalmas a következő típusokhoz:</p>\n<ul>\n    <li>Audi A3 (Typ: 8P)</li>\n    <li>Audi A3 Sportback (Typ: 8P)</li>\n    <li>Audi A3 Cabrio (Typ: 8P)</li>\n    <li>Első tengely terhelés: 1036-1170kg</li>\n    <li>Hátsó tengely terhelés: 1150kg</li>\n    <li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n    <li>Ültetés mértéke elöl: 35-70mm</li>\n    <li>Ültetés mértéke hátul: 35-60mm</li>\n    <li>TÜV engedéllyel rendelkezik</li>\n    <li>Fontos! Rövidített stabilizátor rúd ajánlott (nem tartalmazza a készlet)</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n    <li>A futóművek rugóit az Eibach gyártja</li>\n    <li>Speciális Eibach rugók sportos teljesítményhez</li>\n    <li>A Sport Series létrehozásakor a fokozott vezetési élmény mellett a széles ültetési tartomány volt a cél</li>\n    <li>Gáztöltésű lengéscsillapítók</li>\n    <li>Magas hatékonyság extrém használat mellett is</li>\n    <li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n    <li>Tökéletes egyensúly a rugó és lengéscsillapító között</li>\n    <li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésén</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Eos (Typ: 1F), 2004-2013.05-ig, (első tengely terhelés 1036-1170kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-eos-typ-1f-2004-2013-05-ig-els-tengely-terheles-1036-1170kg-sport-series-allithato-magassagu-futomu'),
(1259, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípushoz:</p>\n<ul>\n	<li>VW Eos Első kerék hajtás</li>\n	<li>Tipuskód: 1F</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 2006.05-től</li>\n	<li>Tengelyterhelés elöl (kg): 1060</li>\n	<li>Tengelyterhelés hátul (kg): 1000</li>\n	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!<br />Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.<br />Adaptív futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n</ul>\n<ul>\n	<li>Ez a futóműszett Német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br />(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +5 mm</li>\n</ul>\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>\n<p><strong>Cikkszáma: GF80-084</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>', 'AP made by KW Volkswagen Eos, kivéve 4-Motion, 2006.05-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-eos-kiveve-4-motion-2006-05-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1260, '', '<div>\n  <p>Ez a moduláris AP-Fahrwerke futómű kompatibilis a következő autótípussal:</p>\n  <ul>\n    <li>VW Eos Elsőkerék-hajtás</li>\n    <li>Tipuskód: 1F</li>\n    <li>Típusváltozat:</li>\n    <li>Évjárat: 2006.05-től</li>\n    <li>Tengelyterhelés elöl (kg): 1150</li>\n    <li>Tengelyterhelés hátul (kg): 1000</li>\n    <li>Egyéb információk: Kivéve a négykerék-meghajtású modelleket!<br />Csak 55 mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.<br />Az adaptív futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység deaktiválása szükséges!</li>\n  </ul>\n  <ul>\n    <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n    <li>Az engedély által meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br />(Mindig nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li>\n    <li>Extra ültetési lehetőség elöl: +10 mm, hátul: +5 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: AP-Fahrwerke, Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF80-085</strong></p>\n  <p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Volkswagen Eos, kivéve 4-Motion, 2006.05-től, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-eos-kiveve-4-motion-2006-05-tol-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(1261, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a Volkswagen Eos autóhoz, típuskód 1F, 2WD. Ez a minőségi futómű szett a maximális vezetési élményt és kényelmet nyújtja, miközben lehetőséget biztosít az ültetés mértékének testreszabására. A készlet magában foglalja a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek a kiegyensúlyozott komfort és dinamika érdekében. Emellett a lengéscsillapítók kiváló korrózió elleni védelmet biztosítanak.</p>\n<p>A termék megfelel a TÜV minősítésnek, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 darab ültető rugót és 4 darab lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező vagy torziós futóművet használnak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968359</p>', 'Vogtland Volkswagen Eos (Typ: 1F), 2008.05-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-eos-typ-1f-2008-05-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1262, '', '<strong>Vogtland</strong> által állítható magasságú futómű szett: VOLKSWAGEN EOS</p>\n<ul>\n	<li><strong>Évjárat</strong>: Az autó gyártásának kezdete óta</li>\n	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm tartományban</li>\n	<li><strong>Típus</strong>: Volkswagen Eos, Typ 1F, 2WD, a lengéscsillapító ház átmérője 55 mm</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1150 kg-ra</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1000 kg-ra</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét a felhasználó igényeinek megfelelően lehet beállítani. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortérzetet és a fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968360</p>', 'Vogtland Volkswagen Eos (Typ: 1F), 2008.05-től, (első tengely terhelés 1061-1150kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-eos-typ-1f-2008-05-tol-els-tengely-terheles-1061-1150kg-allithato-magassagu-futomu'),
(1263, '', '<p>Az MTS-Technik Street állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az kedvező ár. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben harmonikus az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n	<li><strong>Skoda Fabia:</strong> 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li>\n	<li>Elülső ültetés mértéke: 15-60mm</li>\n	<li>Hátsó ültetés mértéke: 15-60mm</li>\n	<li>Elülső tengely terhelés: 960kg</li>\n	<li>Hátsó tengely terhelés: 840kg</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelésnél is</li>\n	<li>Két rétegű bevonat a hosszútávú korrózióvédelem érdekében</li>\n	<li>Ideális összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>', 'MTS-Technik by Nord Performance Volkswagen Fox, 2005-től állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-fox-2005-tol-allithato-magassagu-futomu'),
(1264, '', '<p>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára készült, akik szeretnék milliméterre precízen beállítani az általuk kívánt ültetést. Az optimális vezetési magatartás és a sportos irányíthatóság kombinációját nyújtjuk, miközben maximális ültetést biztosítunk.</p>\\r\\n\\r\\n<p>Egy alumínium rugótányér segítségével lehetőség van az autó magasságának egyénileg történő beállítására, mindemellett a TÜV által engedélyezett tartományon belül. A sportosság, a kényelem és a biztonság tökéletes összehangolása egy optimális felépítést eredményez.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Fox (Typ: 5Z), 2005.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-fox-typ-5z-2005-04-tol-allithato-magassagu-futomu'),
(1265, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett speciálisan a Volkswagen Fox, Typ 5Z típusú autókhoz lett tervezve. Az évjárattól függően (\'05.07-től) 30-60 / 30-60 mm tartományban lehet módosítani az ültetést. Az elülső tengelyterhelés maximum 870 kg, míg a hátsó tengelyterhelés maximum 800 kg lehet. A futómű kiválóan javítja az autó megjelenését és biztosítja a maximális vezetési élményt. A készlet magas teljesítményű kétcsöves lengéscsillapítókat tartalmaz alacsony nyomású gázrendszerrel a kiegyensúlyozott komfort és fokozott dinamika érdekében. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és a termék TÜV minősítéssel rendelkezik. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, és 2 év garanciát biztosít az ültető rugókra és lengéscsillapítókra. A szett általában 4 ültető rugót és 4 lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autóknál. Made in Germany!</p>\n<p>Cikkszám: 968361</p>', 'Vogtland Volkswagen Fox, 2005.04-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-fox-2005-04-tol-allithato-magassagu-futomu'),
(1266, '', '<p>Egy olyan sportos futómű, amely lehetővé teszi a magasság szabad beállítását a Volkswagen Golf 1 JOM BLUE LINE-hez. Ezt a futóművet Németországban gyártották, és rendelkezik német nyelvű TÜV engedéllyel. A csomagolás tartalmazza ezt az engedélyt. A futóművet 2 év teljes körű garanciával szállítjuk. Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint egy állítókulcsot a beállításhoz. Ideális választás kiváló minőségű termékért hihetetlenül jó áron!</p>', 'Jom Bochum Volkswagen Golf 1, beleértve Cabrio, 1974.04-1993-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-1-beleertve-cabrio-1974-04-1993-ig-blue-line-allithato-magassagu-futomu'),
(1267, '', '<div>\\n<p style=\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\">\\nAz alábbi leírásban szereplő termék egy olyan sportos futómű, melyet a Volkswagen Golf 1-hez terveztek, és jellemzője a függetlenített magasságállítás. A futómű kiváló választás lehet azok számára, akik szeretnék sportosabbá tenni autójukat, és fontos számukra a magasság könnyű és egyedi beállítása.\\n</p>\\n</div>', 'V-Maxx Volkswagen Golf 1, beleértve Cabrio, 1974.04-1993-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-1-beleertve-cabrio-1974-04-1993-ig-allithato-magassagu-futomu'),
(1268, '', '<strong>Volkswagen Golf 1 MTS-Technik Street állítható magasságú sport futómű</strong></p> <p>A MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár! A futómű könnyen állítható a útviszonyoknak megfelelően, így könnyedén beállítható az autó hasmagassága! Az MTS-Technik futóművei a rugók és a lengéscsillapítók közötti optimális egyensúlyt biztosítják.</p> <p><u>A termék alkalmas a következő típusokhoz:</u></p> <ul> <li><strong>Volkswagen Golf 1, </strong>1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> <li><strong>Volkswagen Golf 1 Cabrio, </strong>1.5 / 1.6 / 1.8</li> <li>Elülső ültetés: 35-80mm</li> <li>Hátsó ültetés: 35-80mm</li> <li>Elülső tengely terhelés: 785kg</li> <li>Hátsó tengely terhelés: 640kg</li> </ul> <p><u>Termék jellemzői:</u></p> <ul> <li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> <li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> <li>Magas hatékonyság extrém igénybevételek esetén is</li> <li>Gáztöltésű lengéscsillapítók</li> <li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> <li>Optimális egyensúly a rugók és a lengéscsillapítók között</li> <li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><u>Termék jellemzői:</u></p> <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p> <p><em>A weboldalon található szöveges tartalmak és képek másolása, sokszorosítása engedély nélkül tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 1, 1974.04-1993-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-1-1974-04-1993-ig-street-series-allithato-magassagu-futomu'),
(1269, '', '<strong>MTS-Technik Comfort állítható magasságú sport futómű</strong></p>  <p>A <strong>MTS-Technik Comfort sorozatú állítható magasságú sport futómű</strong> ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz! Az <strong>MTS-Technik Comfort állítható futóművei</strong> harmonikusan működnek az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>.</p>  <p><u>A következő modellekhez ajánlott:</u></p>  <ul> 	<li><strong>Volkswagen Golf 1,</strong> 1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> 	<li><strong>Volkswagen Golf 1 Cabrio,</strong> 1.5 / 1.6 / 1.8</li> 	<li>Elülső ültetés: 35-80mm</li> 	<li>Hátsó ültetés: 35-80mm</li> 	<li>Elülső tengely terhelés: 785kg</li> 	<li>Hátsó tengely terhelés: 640kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li> 	<li>A <strong>Comfort sorozat</strong> létrehozásakor nem az extrém ültetés volt a cél, hanem a <strong>magas kényelem</strong></li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszútávú korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást a jármű felfüggesztésén</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/comfortmts.jpg\\\" /></strong></u></p>  <p><em>A weblap tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 1, 1974.04-1993-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-1-1974-04-1993-ig-comfort-series-allithato-magassagu-futomu'),
(1270, '', '<strong>Volkswagen Golf 1 MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futóművei optimális választásnak bizonyulnak azok számára, akik nem szeretnének kompromisszumot kötni! A magasság fokozatmentesen állítható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az <strong>MTS-Technik Sport futóművei</strong> tökéletes harmóniát teremtenek az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt!</p>  <p><u>Az alábbi típusokhoz kompatibilis:</u></p>  <ul> 	<li><strong>Volkswagen Golf 1, </strong>1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> 	<li><strong>Volkswagen Golf 1 Cabrio,</strong> 1.5 / 1.6 / 1.8</li> 	<li>Elülső ültetés: 35-80mm</li> 	<li>Hátsó ültetés: 35-80mm</li> 	<li>Elülső tengely terhelhetőség: 785kg</li> 	<li>Hátsó tengely terhelhetőség: 640kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>Speciális <strong>Eibach rugók</strong> a sportos teljesítményért</li> 	<li>A <strong>Sport Series</strong> létrehozásakor a széles ültetési tartomány mellett a fokozott vezetési élmény volt a fő szempont</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Ideális összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldalon található tartalmak és képek másolása, sokszorosítása engedély nélkül tilos!</em></p>  ', 'MTS-Technik by Nord Performance Volkswagen Golf 1, 1974.04-1993-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-1-1974-04-1993-ig-sport-series-allithato-magassagu-futomu'),
(1271, '', '<div>\n<p>Az AP-Fahrwerke Állítható magasságú futóművet használhatod a következő autóhoz:</p>\n\n<ul>\n	<li>VW Golf 1 (beleértve a Cabrio változatot is)</li>\n	<li>Tipuskód: 17,155</li>\n	<li>Típus variáció:</li>\n	<li>Évjárat: 1974.04 - 1993.08</li>\n	<li>Tengelyterhelés elöl (kg): 785</li>\n	<li>Tengelyterhelés hátul (kg): 640</li>\n	<li>Egyéb kitételek: -</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-70 mm, hátul: 40-70 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +40 mm, hátul: +40 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártó: Ap-Fahrwerke, Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>11580001</p>\n\n<p><br />\nAz ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Volkswagen Golf 1, beleértve Cabrio, 1974.04-1993-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-1-beleertve-cabrio-1974-04-1993-ig-allithato-magassagu-futomu'),
(1272, '', '<div>\nA Volkswagen Golf 1 V-Maxx cserélhető futóművet kínál, amelynek magassága és keménysége testreszabható.\n</div>', 'V-Maxx Volkswagen Golf 1, beleértve Cabrio, 1974.04-1993-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-1-beleertve-cabrio-1974-04-1993-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1273, '', '<p><strong>Vogtland</strong><span> által készített állítható magasságú futómű szett</span>: VOLKSWAGEN GOLF 1</p>\n<ul>\n	<li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Golf I / Jetta I, Typ 17, 155, beleértve a Cabrio modelleket</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 785 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 640 kg</li>\n</ul>\n<p>Az autó megjelenését javító Vogtland futómű szett nemcsak esztétikus, de maximális vezetési élményt is nyújt. Az ültetés mértékét saját elképzelése szerint állíthatja be a megfelelő értékek között. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók első osztályú korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Manufactured in Germany!</p>\n<p>Cikkszám: 968362</p>', 'Vogtland Volkswagen Golf 1, beleértve Cabrio, 1979.09-1993.08-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-1-beleertve-cabrio-1979-09-1993-08-ig-allithato-magassagu-futomu'),
(1274, '', '<div><strong>Jom BlueLine állítható magasságú sportfutómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A BlueLine futóművek kiemelkedő minőséget képviselnek, és minden típusra egyedileg tervezettek. Az autó magassága könnyedén módosítható egy speciális kulcs segítségével a megadott tartományon belül.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>- Rendelkezik 19.3 TÜV minősítéssel</div>\\r\\n\\r\\n<div>- Az EPS technológiával porfestett és horganyzott alkatrészekkel készültek</div>', 'Jom Bochum Volkswagen Golf 2, kivéve Syncro, 1983.08-1991.11-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-2-kiveve-syncro-1983-08-1991-11-ig-blue-line-allithato-magassagu-futomu'),
(1275, '', '<div>\n<p style=\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\">\nSport futómű, melynek magassága állítható, Volkswagen Golf 2 típusú autókhoz.\n</p>\n</div>', 'V-Maxx Volkswagen Golf 2, kivéve Syncro, 1983.08-1991.11-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-2-kiveve-syncro-1983-08-1991-11-ig-allithato-magassagu-futomu'),
(1276, '', '<strong>Volkswagen Golf 3 Syncro MTS-Technik Street Series állítható magasságú sport futómű</strong></p>  <ul> 	<li><strong>Volkswagen Golf 3 Syncro</strong>, 1.8 Syncro / 2.0 Syncro / 2.9 VR6 Syncro / 1.9TDI Syncro</li> 	<li><strong>Volkswagen Golf 3 Variant Syncro</strong>, 1.8 Syncro / 2.0 Syncro / 2.9 VR6 Syncro / 1.9TDI Syncro</li> 	<li>Első tengely terhelés: 1035kg</li> 	<li>Hátsó tengely terhelés: 1060kg</li> 	<li>Ültetés mértéke elöl: 25-80mm</li> 	<li>Ültetés mértéke hátul: 25-80mm</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/63b0cc1d1f0f346703d0078447f3850b/27087_6618.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/46305ff5c78ceab53cc10d08b18cb321/27087_6617.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azoknak, akik számára lényeges a kiváló minőség és az megfizethető ár. A futóművek magassága fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság általában 25 és 80 mm között szabadon állítható</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Optimális egyensúly rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><u><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></u></p>  <p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Volkswagen Golf 2 Syncro, beleértve Variant Syncro, 1986-1992-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-2-syncro-beleertve-variant-syncro-1986-1992-ig-street-series-allithato-magassagu-futomu'),
(1277, '', '<div style=\"box-sizing:border-box; color:#424242; font-size:13.3333px; word-wrap:break-word\"><p>Ez a futómű passzol a VW Golf 2 típusú járművekhez, beleértve az első kerék meghajtású modelleket és a G60-at is.</p><ul><li>A tipuskód: 19E</li><li>Évjárat: 1983.08 - 1991.11</li><li>Elülső tengelyterhelés: 840 kg, hátsó tengelyterhelés: 740 kg</li><li>Azokon kívül, melyek négykerék-meghajtással rendelkeznek.</li></ul><ul><li>A futóműszett TÜV engedéllyel rendelkezik német nyelven.</li><li>Az engedélyben meghatározott ültetés mértéke: elöl: 40-70 mm, hátul: 40-70 mm között állítható.<br />(Bár nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokat engedélyezi.)</li><li>További ültetési lehetőség: elöl: +70 mm, hátul: +50 mm</li></ul><ul><li>A termék az Ap-Fahrwerke németországi gyártmány.</li><li>2 év garancia vonatkozik a termékre.</li></ul><p><strong>Cikkszám: GF80-002</strong></p><p><br />Az ár egy szettre vonatkozik.</p>', 'AP made by KW Volkswagen Golf 2, kivéve Syncro, 1983.08-1991.11-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-2-kiveve-syncro-1983-08-1991-11-ig-allithato-magassagu-futomu'),
(1278, '', '<div>\n<p style=\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\">\nA Volkswagen Golf 2 sportos kategóriájú autó, amely V-Maxx futóművel rendelkezik. Ez a futómű állítható magassággal és keménységgel rendelkezik, így lehetőséget biztosít a felhasználónak a személyre szabott beállításokra.\n</p>\n</div>', 'V-Maxx Volkswagen Golf 2, kivéve Syncro, 1983.08-1991.11-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-2-kiveve-syncro-1983-08-1991-11-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1279, '', '<div> <p>Ez a <strong>AP-Fahrwerke Állítható magasságú futómű</strong> alkalmas a következő autótípusra:</p>  <ul> 	<li>VW Golf 3 Syncro, beleértve Variant</li> 	<li>Tipuskód: 1HXO, 1H, 1E</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1993.01-től</li> 	<li>Tengelyterhelés elöl (kg): 980</li> 	<li>Tengelyterhelés hátul (kg): 990</li> 	<li>Egyéb kitételek: Az optimális gumi és felnikombinációhoz nyomtávszélesítő szükséges!</li> </ul>  <ul> 	<li>Ez a futómű Németországban gyártott és rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben szereplő ültetési tartomány elöl: 40-70 mm, hátul: 40-70 mm között állítható<br /> 	(A futómű ennél tágabb tartományban is állítható, azonban a TÜV engedély csak ezekkel az értékekkel érvényes.)</li> 	<li>Extra ültetési lehetőség elöl: +60 mm, hátul: +95 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF80-053</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Volkswagen Golf 2 Syncro, beleértve Rallye, 1983.08-1991.11-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-2-syncro-beleertve-rallye-1983-08-1991-11-ig-allithato-magassagu-futomu'),
(1280, '', '<div><strong>Vogtland állítható magasságú sport futómű a Volkswagen Golf 2 autóhoz</strong></div> <div> </div> <div><span>Elülső ültetési tartomány: 40-70mm</span><br /> <br /> <span>Hátsó ültetési tartomány: 40-70mm</span><br /> <br /> <span>Maximális terhelhetőség az első/hátsó tengelyeken: 840 kg / 740 kg</span><br /> <br /> <span>A futóművet TÜV engedéllyel látták el!</span></div>', 'Vogtland Volkswagen Golf 2, kivéve Syncro, 1983.08-1991.11-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-2-kiveve-syncro-1983-08-1991-11-ig-allithato-magassagu-futomu'),
(1281, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a Volkswagen Golf II, 19E-299 és Syncro modellekhez, beleértve a Rallye Golf (4WD) változatot is. Az évjáratot tekintve 1983-tól 1991-ig használható. Az ültetés mértéke 35-50 mm lehet mind elöl, mind hátul, maximális tengelyterhelés elől 980 kg, míg hátul 990 kg. A futómű engedélyének részleteit itt találod: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF53_1550-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW800GF53_1550-10.pdf</a>.</p>\n\n<p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanapság vezetési élményt is nyújt. A rugós és lengéscsillapítós rendszer kiegyensúlyozott komfortot és fokozott dinamikát biztosít az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, így hosszú távon is kiválóan működnek.</p>\n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Made in Germany!</p>\n\n<p>Cikkszám: 968540</p>', 'Vogtland Volkswagen Golf 2 Syncro, beleértve Rallye, 1983-1991-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-2-syncro-beleertve-rallye-1983-1991-ig-allithato-magassagu-futomu'),
(1282, '', '<div><strong>Volkswagen Golf 3 Bilstein B14 állítható magasságú futómű</strong><br />\\r\\n<br />\\r\\nAz egyedülálló BILSTEIN egycsöves rendszerének köszönhetően a Volkswagen Golf 3 Bilstein B14 futómű Upside-Down technológiával és versenysport rugókkal rendelkezik nagy szilárdságú anyagból. Az állítható magasság lehetővé teszi a rugótányér és a kontra anya alumíniumból történő precíz beállítását. A B14 PSS modellel a jármű magassága mind az első, mind a hátsó tengelynél akár 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű egycsöves Upside-Down technológia garantálja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben.</div>\\r\\n\\r\\n<div><br />\\r\\n<br />\\r\\n<span>Maximális ültetés elöl: 30 - 50 mm</span><br />\\r\\n<span>Maximális ültetés hátul: 10 - 30 mm</span></div>', 'Bilstein Volkswagen Golf 2, 1983.08-1991.11-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-2-1983-08-1991-11-ig-bilstein-b14-allithato-magassagu-futomu'),
(1283, '', '<div> <div><strong>A Volkswagen Golf 3 BILSTEIN B16 PSS9 állítható magasságú és keménységű futómű</strong></div> <div> </div> <ul>     <li>A BILSTEIN egycsöves rendszerrel van felszerelve</li>     <li>A BILSTEIN gáztöltéses technológiával rendelkezik</li>     <li>Egyszerűen szabályozható csillapítási erővel</li>     <li>Triple-C-Technology felületkezeléssel a hosszú távú korrózióvédelem érdekében</li>     <li>Upside-Down technológiát alkalmaz</li>     <li>Versenysportrugók nagy szilárdságú anyagból készültek</li>     <li>Rugótányér és kontra anya alumíniumból állítható magassággal</li>     <li>Húzó és nyomófokozat egyidejűleg 9 fokozatban beállítható</li>     <li>TÜV minősítéssel rendelkezik</li> </ul> <div>A BILSTEIN mérnökei egy új teljesítménykategóriát alkottak ezzel a futóművel! A B16 PSS9 lengéscsillapítóval a jármű magassága az első és hátsó tengelyen max. 50 mm-rel csökkenthető egy behatárolt 20 mm-es állítási tartományon belül. Beépített állapotban a beállító kerék segítségével 9 karakterisztika változtatható, biztosítva a jármű professzionális beállítását minden körülmények között.</div> <div> </div> <div>Elöl: 30-50 mm-es állítási tartomány</div> <div>Hátul: 10-30 mm-es állítási tartomány</div> <div>Első tengely terhelés: 980 kg</div> <div>Hátsó tengely terhelés: 840 kg</div> </div> <div> </div>', 'Bilstein Volkswagen Golf 2, kivéve Syncro, 1983.08-1991.11-ig, Bilstein B16 állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-2-kiveve-syncro-1983-08-1991-11-ig-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(1284, '', '<p>Egy állítható magasságú sport futómű a VW Golf 3 JOM BLUELINE számára, mely 1991.09 és 1997.09 közötti években gyártott típusokhoz kompatibilis. A futómű alkalmazható a 1H, 1HXO, 1E, 1EXO típusjelzésű modellekhez. Elöl 955 kg, míg hátul 820 kg tengelyterhelést képes elviselni. Fontos megjegyzés, hogy nem kompatibilis a Syncro és Variant modellekkel. A termék MADE IN GERMANY, rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Biztosítunk 2 ÉV TELJESKÖRŰ GARANCIÁT is! Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével. Kiemelkedő minőségű termék hihetetlenül kedvező áron! A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot. Termékcikkszám: 741000.</p>', 'Jom Bochum Volkswagen Golf 3, kivéve Syncro és Variant, 1991.09-1997.09-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-3-kiveve-syncro-es-variant-1991-09-1997-09-ig-blue-line-allithato-magassagu-futomu'),
(1285, '', '<p>Egy állítható magasságú sport futómű toronycsapágyakkal, mely kifejezetten a VW Golf 3 modellekhez lett tervezve. Ez a futómű ideális választás az 1991.09 - 1997.09 között gyártott 1H / 1HXO / 1E / 1EXO típusú autókhoz. Az elöl elhelyezkedő tengelyterhelés 955 kg, míg a hátsó tengelyterhelés 820 kg. Fontos megjegyezni, hogy a Syncro és Variant modellekhez nem kompatibilis. A futómű MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Garanciális feltételeink kiválóak: 2 év teljeskörű garanciával rendelkezik. Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével. A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot. Rendelési cikkszám: 741000S2.</p>', 'Jom Bochum Volkswagen Golf 3, kivéve Syncro és Variant, 1991.09-1997.09-ig, Blue Line, toronycsapágyakkal állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-3-kiveve-syncro-es-variant-1991-09-1997-09-ig-blue-line-toronycsapagyakkal-allithato-magassagu-futomu'),
(1286, '', '<div> \\n<strong style=\\\\\\\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\\\\\\\">\\nAz állítható magasságú Volkswagen Golf 3 Variant V-Maxx sport futóműve\\n</strong>', 'V-Maxx Volkswagen Golf 3 Variant, kivéve Syncro, 1994.09-1998.11-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-3-variant-kiveve-syncro-1994-09-1998-11-ig-allithato-magassagu-futomu'),
(1287, '', '<div>\\n<strong style=\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\">\\nA Volkswagen Golf 3 V-Maxx kategóriájú jármű rendelkezik sportos futóműállítással.\\n</strong>', 'V-Maxx Volkswagen Golf 3, kivéve Syncro és Variant, 1991.09-1997.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-3-kiveve-syncro-es-variant-1991-09-1997-09-ig-allithato-magassagu-futomu'),
(1288, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azoknak, akik számára fontos a kiváló minőség és az elérhető ár. Ezek a futóművek fokozatmentesen állítható magassággal rendelkeznek, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az MTS-Technik futóműveinek kialakításában kiemelt figyelmet kapott a rugók és a lengéscsillapítók optimális együttműködése.</p>\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n	<li><strong>Volkswagen Golf 3 Variant,</strong> 1.4 / 1.6 / 1.8 / 1.9 D / 1.9 SDI / 1.9 TD / 1.9 TDI / 2.0</li>\n	<li>Elülső ültetés: 25-80mm</li>\n	<li>Hátsó ültetés: 50-130mm</li>\n	<li>Elülső tengely terhelés: 980kg</li>\n	<li>Hátsó tengely terhelés: 890kg</li>\n	<li>Rugó erősség (elülső, fő rugó): 60 N/mm</li>\n	<li>Rugó erősség (elülső, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 50 N/mm</li>\n	<li>Rugó erősség (hátsó, segéd rugó): 5,66 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van!</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Optimális együttműködés a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 3 Variant, kivéve Syncro, 1993.07-1999.04-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-3-variant-kiveve-syncro-1993-07-1999-04-ig-street-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1289, '', '<strong>Volkswagen Golf 3 Syncro MTS-Technik Street Series állítható magasságú sport futómû</strong></p>  <ul> 	<li><strong>Volkswagen Golf 3 Syncro</strong>, 1.8 Syncro / 2.0 Syncro / 2.9 VR6 Syncro / 1.9TDI Syncro</li> 	<li><strong>Volkswagen Golf 3 Variant Syncro</strong>, 1.8 Syncro / 2.0 Syncro / 2.9 VR6 Syncro / 1.9TDI Syncro</li> 	<li>Elsõ tengely terhelés: 1035kg</li> 	<li>Hátsó tengely terhelés: 1060kg</li> 	<li>Ültetés mértéke elõl: 25-80mm</li> 	<li>Ültetés mértéke hátul: 25-80mm</li> 	<li>Letölthetõ dokumentum:<strong> <a href=\\\"https://mtstechnik.com/data/links/63b0cc1d1f0f346703d0078447f3850b/27087_6618.pdf\\\"><span>TÜV engedély</span></a>, <a href=\\\"https://mtstechnik.com/data/links/46305ff5c78ceab53cc10d08b18cb321/27087_6617.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a minőséget és az ár-érték arányt. A futómű magassága fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő egyensúlyt biztosítanak a rugók és a lengéscsillapítók között. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>Az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> 	<li>Kiváló egyensúly a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel változtatást az autó felfüggesztésén</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><u><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Volkswagen Golf 3 Syncro, beleértve Variant Syncro, 1991-1997-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-3-syncro-beleertve-variant-syncro-1991-1997-ig-street-series-allithato-magassagu-futomu'),
(1290, '', '<strong>V-Maxx állítható magasságú és rugalmas sport futómű a Volkswagen Golf 3-hoz</strong><br /><ul><br /><li>A Volkswagen Golf 3 különböző motorváltozatokkal és gyártási évekkel került piacra</li><br /><li>A termék gyártási időszaka: 1991.09-1997.09</li><br /><li>A futómű keménysége 20 különböző fokozatban szabályozható</li><br /><li>Kivétel a Syncro és Variant típusok</li><br /><li>Az ülésmagasság elöl és hátul egyaránt 25-80mm között állítható</li><br /><li>A V-Maxx futómű Hollandiában készül</li><br /><li>TÜV engedéllyel rendelkezik, a bejegyzés jelenleg folyamatban van</li><br /><li>24 hónapos garancia minden V-Maxx lengőtekerőre</li><br /></ul><br /><p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/vmaxk.jpg\\\" style=\\\"height:400px; width:400px\\\" /></p><br />', 'V-Maxx Volkswagen Golf 3, kivéve Syncro és Variant, 1991.09-1997.09-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-3-kiveve-syncro-es-variant-1991-09-1997-09-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1291, '', '<p>A Volkswagen Golf 3 Variant AP által készített KW állítható magasságú futóművet kifejezetten a sportosan ambiciózus vezetők számára tervezték. Ez a futómű lehetővé teszi a felhasználók számára, hogy milliméteres pontossággal állítsák be az általuk kívánt ültetést. A sportos irányíthatóság és az optimális vezetési magatartás kombinációját kínálja, miközben maximális ültetéssel is rendelkezik.\n\nAz AP futómű alumínium rugótányér segítségével lehetővé teszi a járműmagasság egyéni beállítását a TÜV által engedélyezett tartományon belül. Ez a futómű olyan felhasználóknak ajánlott, akik fontosnak tartják a sportosságot, kényelmet és biztonságot egyaránt, és ezeket optimálisan szeretnék összehangolni.\n\nA futómű kiváló minőségű alkatrészekből készül, és rendelkezik TÜV tanúsítvánnyal. Emellett egyedülálló ár/érték arányt kínál, és a német minőség jegyében lett tervezve.</p>', 'AP made by KW Volkswagen Golf 3 Variant, kivéve Syncro, 1993.12-1999-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-3-variant-kiveve-syncro-1993-12-1999-ig-allithato-magassagu-futomu'),
(1292, '', '<div>\n<div><strong>Volkswagen Golf 3 AP by KW állítható magasságú futómű</strong></div>\n\n<ul>\n<li>Első tengely terhelés: 891-980kg</li>\n<li>Kivéve: Variant és Syncro</li>\n<li>Letölthető dokumentumok: <strong><a href=\"https://www.ap.de/documents/gaAPGFW80-004_1095-11.pdf\"><span>TÜV engedély</span></a>, <a href=\"https://www.ap.de/documents/ea_ap_GF_80004.pdf\"><span>szerelési útmutató</span></a></strong></li>\n</ul>\n\n<div>Az AP futómű lehetőséget kínál a vezető számára, hogy milliméter pontosan beállítsa az általa kívánt ülésmagasságot, így sportos irányíthatóságot és optimális vezetési magatartást érhet el.</div>\n\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg lehet beállítani a TÜV által engedélyezett tartományban, így biztosítva a sportosságot, kényelmet és biztonságot.</div>\n\n<ul>\n<li>kiváló minőség megfizethető áron</li>\n<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n<li>egyedülálló ár/érték arány</li>\n<li>német minőség</li>\n</ul>\n</div>', 'AP made by KW Volkswagen Golf 3, kivéve Variant és Syncro, 1991.11-1997-ig, (első tengely terhelés 891-980kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-3-kiveve-variant-es-syncro-1991-11-1997-ig-els-tengely-terheles-891-980kg-ig-allithato-magassagu-futomu'),
(1293, '', '<p><strong>Vogtland</strong><span> általános állítható magasságú futómű szett</span>: VOLKSWAGEN GOLF 3 VARIANT</p>\n<ul>\n	<li><strong>Évjárat</strong>: Az 1993-as évtől kezdve</li>\n	<li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Golf III Variant</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 980 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 890 kg</li>\n	<li> </li>\n</ul>\n<p>Az autó külső megjelenésén javítva emellett maximális vezetési élményt kínál. Az ültetés mértékét személyes igényei szerint állíthatja be. A kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsövű lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. A lengéscsillapítók első osztályú korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely már több mint 100 éve van jelen a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autóknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968683</p>', 'Vogtland Volkswagen Golf 3 Variant, kivéve Syncro, 1993.07-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-3-variant-kiveve-syncro-1993-07-tol-allithato-magassagu-futomu'),
(1294, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN GOLF 3</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1992-1997</li>\n	<li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Golf III</li>\n	<li><strong>Kivéve:</strong> Syncro és Variant</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 980 kg</li>\n	<li><strong>Max. tengelyterhelés hátu</strong>l: 880 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett maximalizált vezetési élményt kínál ez a futómû szett. Az ültetés mértékét az egyéni igényeknek megfelelõen állíthatja be. A kiváló minõségű futómű csak speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és dinamizmus között. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó vállalat, mely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968213</p>', 'Vogtland Volkswagen Golf 3, kivéve Syncro és Variant, 1992.01-1997.02-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-3-kiveve-syncro-es-variant-1992-01-1997-02-ig-allithato-magassagu-futomu'),
(1295, '', '<div> <p>Ez a AP-Fahrwerke Állítható magasságú futómû alkalmas a következõ autó típusához:</p>  <ul> 	<li>VW Golf 3 Syncro, beleértve Variant</li> 	<li>Tipuskód: 1HXO, 1H, 1E</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1993.01-tõl</li> 	<li>Tengelyterhelés elöl (kg): 980</li> 	<li>Tengelyterhelés hátul (kg): 990</li> 	<li>Egyéb megjegyzések: Az eredeti abroncs- és felnikombináció esetén nyomtávszélesítõ szükséges!</li> </ul>  <ul> 	<li>Ez a futómû Német nyelvû TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-70 mm, hátul: 40-70 mm között állítható<br /> 	(A futómû ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li> 	<li>Maximális ültetés lehetõség elöl: +60 mm, hátul: +95 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>Garancia idõtartama: 2 év</li> </ul>  <p><strong>Cikkszám: GF80-053</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Volkswagen Golf 3 Syncro, 1993.01-1997-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-3-syncro-1993-01-1997-ig-allithato-magassagu-futomu'),
(1296, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN GOLF 3</p>  \n<ul>  \n    <li><strong>Évjárat</strong>: 1993-tól</li>  \n    <li><strong>Ültetés mértéke:</strong> 35 - 50 / 35 - 50 mm</li>  \n    <li><strong>Típus</strong>: Volkswagen Golf III Syncro</li>  \n    <li><strong>Max. tengelyterhelés elõl</strong>: 980 kg</li>  \n    <li><strong>Max. tengelyterhelés hátu</strong>l: 990 kg</li>  \n</ul>  \n<p>Az autó megjelenésének javítása mellett kiváló vezetési élményt biztosít. Az ültetés mértékét az egyéni igények szerint könnyedén beállíthatja. A futómű kiváló minőségű, kétcsöves lengéscsillapítókkal rendelkezik, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  \n<p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező vagy torziós futóművet szereltek.</p>  \n<p>Németországban gyártva!</p>  \n<p>Cikkszám: 968363</p>  ', 'Vogtland Volkswagen Golf 3 Syncro, 1993.01-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-3-syncro-1993-01-tol-allithato-magassagu-futomu'),
(1297, '', '<div><strong>Volkswagen Golf 3 Bilstein B14 állítható magasságú futómû</strong><br />\\r\\n<br />\\r\\nAz egyedi BILSTEIN egycsöves rendszerre épülő Volkswagen Golf 3 Bilstein B14 futómű a legmagasabb szintű versenysport technológiát kínálja az utcai használatra. A B14 PSS lehetővé teszi a jármű magasságának szabályozását, akár 50 mm-rel az első és hátsó tengelyen egy 20 mm-es állítási tartományon belül. A futómű Upside-Down technológiával rendelkezik, amely biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét bármilyen helyzetben.</div>\\r\\n\\r\\n<div><br />\\r\\n<br />\\r\\n<span>Maximális ültetés elöl: 30 - 50 mm</span><br />\\r\\n<span>Maximális ültetés hátul: 10 - 30 mm</span></div>', 'Bilstein Volkswagen Golf 3, kivéve Variant és Syncro, 1992.01-1997.02-ig, Bilstein B14 állítható magasságú sport futómű állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-3-kiveve-variant-es-syncro-1992-01-1997-02-ig-bilstein-b14-allithato-magassagu-sport-futomu-allithato-magassagu-futomu'),
(1298, '', '<div>\n<p>Ez a JOM BlueLine Állítható magasságú futómű ideális választás a VW Golf 4 autóhoz.</p>\n\n<ul>\n	<li>Ez az futóműszett tökéletesen illeszkedik a következő autótípushoz: VW Golf 4</li>\n	<li><strong>Kivéve: </strong>4-Motion</li>\n	<li>Tipuskód: 1J</li>\n	<li>Változat: 1.4/ 1.6/ 1.8/ 1.8T/ 2.0/ 2.3 V5/ 2.8 V6/ 1.9SDi/ 1.9TDI</li>\n	<li>Évjárat: 1997 &ndash; 2006</li>\n	<li>Tengelyterhelés elöl (kg): 1020</li>\n	<li>Tengelyterhelés hátul (kg): 1025</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-60mm, hátul: 30-60mm között állítható<br />\\r\\n	(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n</ul>\n\n<ul>\n	<li>Made In JOM Németország</li>\n	<li><strong><u>A TÜV engedély elérhető a következő linken:</u></strong>  <strong><a href=\\\"https://www.jom.de/media/files_public/036d5522be5dee6e7b82e48a13cf4d20/741001%20update%2029082019.pdf\\\"><span>Golf 4 JOMBlueline TÜV engedély</span></a></strong></li>\n</ul>\n\n<p><strong>Cikkszáma: 741001</strong></p>\n\n<p><br />\\r\\nAz ár 1 szettre vonatkozik!</p>\n\n<p> </p>\n\n<p>A JOM Blueline Állítható magasságú futóműszett kiváló minőségű autó-specifikus alkatrészekből áll.</p>\n\n<p>A magasságbeállítás egyéni igények szerint állítható a fent megadott paraméterek között.</p>\n\n<p>A rugó keménysége és a csillapítás mértéke a teljes beállítási tartományban egyenlő.</p>\n\n<p>A különlegesen nagy kanyarstabilitást biztosít, mert rendkívül ellenáll a keresztirányú erőknek.</p>\n</div>', 'Jom Bochum Volkswagen Golf 4, kivéve 4-Motion, 1998.12-2003.11-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-4-kiveve-4-motion-1998-12-2003-11-ig-blue-line-allithato-magassagu-futomu'),
(1299, '', '<div>\\r\\n<p>Ez a JOM BlueLine Állítható magasságú futómű tökéletesen illeszkedik a következő autótípushoz:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>VW Golf 4</li>\\r\\n	<li><strong>Kivéve: </strong>4-Motion</li>\\r\\n	<li>Tipuskód: 1J</li>\\r\\n	<li>Változat: 1.4/ 1.6/ 1.8/ 1.8T/ 2.0/ 2.3 V5/ 2.8 V6/ 1.9SDi/ 1.9TDI</li>\\r\\n	<li>Évjárat: 1997 &ndash; 2006</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1020</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1025</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-60mm, hátul: 30-60mm között állítható<br />\\r\\n	(Szinte minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>JOM termék, gyártva Németországban</li>\\r\\n	<li><strong><u>A TÜV engedély letölthető innen:</u></strong>  <strong><a href=\\\"https://www.jom.de/media/files_public/036d5522be5dee6e7b82e48a13cf4d20/741001%20update%2029082019.pdf\\\"><span>Golf 4 JOMBlueline TÜV engedély</span></a></strong></li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszáma: 741001</strong></p>\\r\\n\\r\\n<p><br />\\r\\nAz ár egy szettre vonatkozik!</p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p>A JOM Blueline Állítható magasságú futóműszett kizárólag kiváló minőségű, autóspecifikus alkatrészekből áll össze.</p>\\r\\n\\r\\n<p>A magasság beállítása személyre szabható az előzőleg említett paraméterek között.</p>\\r\\n\\r\\n<p>A rugó keménysége és a csillapítás mértéke teljes beállítási tartományban állandó.</p>\\r\\n\\r\\n<p>Rendkívüli kanyarstabilitást biztosít a nagy ellenállás a keresztirányú erőkkel szemben.</p>\\r\\n</div>', 'Jom Bochum Volkswagen Golf 4, kivéve 4-Motion, 1998.12-2003.11-ig, Blue Line, toronycsapágyakkal állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-4-kiveve-4-motion-1998-12-2003-11-ig-blue-line-toronycsapagyakkal-allithato-magassagu-futomu'),
(1300, '', '<strong>Volkswagen Golf 4 4-Motion JOM Blueline állítható magasságú sport futómû</strong></p>\\r\\n\\r\\n<p>A Volkswagen Golf 4 4-Motion, beleértve a Variant modellt is, az 1998. decemberétől 2003. novemberéig terjedő időszakban volt gyártás alatt. Az autó tengelyterhelése elöl 1050 kg, míg hátul 1080 kg. A futómű hátsó részén a magasságállító a rugó alatt található. Ez a futómű MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 1 ÉV TELJESKÖRŰ GARANCIÁVAL kapható. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot az egyszerű beállításhoz.</p>\\r\\n', 'Jom Bochum Volkswagen Golf 4 4-Motion, beleértve Variant, 1998.12-2003.11-ig állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-4-4-motion-beleertve-variant-1998-12-2003-11-ig-allithato-magassagu-futomu'),
(1301, '', '<strong>Volkswagen Golf 4 FK-Automotive AK Street Állítható Magasságú Futómû</strong></p>\\r\\n\\r\\n<p>A Volkswagen Golf 4 egyéni megjelenését szeretné fokozni? A FK-Automotive AK Street állítható futómű segítségével könnyedén alakíthatja autójának megjelenését. Ez a futómű kiváló minőségű, sportos és strapabíró, és TÜV engedéllyel rendelkezik. Elöl és hátul is állítható magassága nagy intervallumban variálható, így az ültetés mértéke cirka 30-60 mm között állítható. Az anyaga acél, és az egyik legjobb alapszintű állítható futóműnek számít a piacon. Megfelel az VW Golf 4 autótípusnak, évjárata 1999.09 - 2005, kivéve a 4-Motion modellt.</p>\\r\\n', 'FK-Automotive Volkswagen Golf 4, kivéve 4-Motion, 1998.12-2003.11-ig állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-golf-4-kiveve-4-motion-1998-12-2003-11-ig-allithato-magassagu-futomu'),
(1302, '', '<p>A Volkswagen Golf 4 4-Motion FK-Automotive által gyártott sport futóműve egy állítható magasságú rendszer, amely kifejezetten a Volkswagen Golf 4 4-Motion és Variant modellekhez készült. A futómű megfelel az 1998.12 - 2003.11 közötti évjáratú autókhoz, és a tengelyterhelés elöl 1050 kg, míg hátul 1080 kg lehet. A magasságállító egység a hátsó tengelyen a rugó alatt található. Ez a futómű Made in Germany, és rendelkezik német nyelvű TÜV engedéllyel, amelyet a csomagolásban megtalálhat. Emellett 1 év teljes körű garanciát biztosítanak rá. A szett tartalmazza a 4 lengéscsillapítót a hozzájuk tartozó rugókkal, valamint az állításhoz szükséges 1 kulcsot. Ne habozzon, válassza a kiváló minőségű, hihetetlenül jó ár-érték arányú Volkswagen Golf 4 4-Motion FK-Automotive futóművet!</p>', 'FK-Automotive Volkswagen Golf 4 4-Motion, beleértve Variant, 1998.12-2003.11-ig állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-golf-4-4-motion-beleertve-variant-1998-12-2003-11-ig-allithato-magassagu-futomu'),
(1303, '', '<p><strong>Volkswagen Golf 4 FK-Automotive Állítható Magasságú és Keménységű Futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Autótípus: Volkswagen Golf 4</li>\\r\\n\\t<li>Évjárat: 1997-2003.11</li>\\r\\n\\t<li>Kivéve: 4-Motion</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Első tengely terhelés: 1020kg</li>\\r\\n\\t<li>Hátsó tengely terhelés: 985kg</li>\\r\\n\\t<li>Állítható magasság elöl és hátul</li>\\r\\n\\t<li><strong>Keménysége szabályozható kivitelben!</strong></li>\\r\\n\\t<li>Nagy skálán állítható magasság</li>\\r\\n\\t<li>Sportos, feszes és tartós kialakítású</li>\\r\\n\\t<li>Német TÜV engedéllyel rendelkezik</li>\\r\\n\\t<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive  Volkswagen Golf 4, kivéve 4-Motion, 1997-2003.11-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive--volkswagen-golf-4-kiveve-4-motion-1997-2003-11-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1304, '', '<div><br /><strong style=\\\"color: rgb(135, 135, 135); font-family: OpenSans-Regular, sans-serif; font-size: 13.3333px; box-sizing: border-box;\\\">A Volkswagen Golf 4 V-Maxx futóműve olyan sportos futómű, amely lehetővé teszi a magasság állítását.<br /></strong><br /></div><br />', 'V-Maxx Volkswagen Golf 4, kivéve 4-Motion, 1998.12-2003.11-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-4-kiveve-4-motion-1998-12-2003-11-ig-allithato-magassagu-futomu'),
(1305, '', '<p>Az MTS-Technik Comfort Series állítható magasságú sport futómű a Volkswagen Golf 4 típusú autókhoz ideális választás azok számára, akik szeretnének sportos megjelenést és kényelmet egyaránt. A futómű fokozatmentesen állítható magassággal rendelkezik, így könnyedén lehet igazítani az autó hasmagasságát az útviszonyoknak megfelelően. Az MTS-Technik Comfort futóművei tökéletes összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p>\n\n<p>A termék jellemzői:</p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort Series létrehozásánál a hangsúly a magas komforton van, nem az extrém ültetésen</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n\n<p><strong>Termék karakterisztika:</strong></p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmának, képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 4, beleértve Variant, kivéve 4-Motion, 1997.09-2006.09-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-4-beleertve-variant-kiveve-4-motion-1997-09-2006-09-ig-comfort-series-allithato-magassagu-futomu'),
(1306, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás lehetnek azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon beállítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében: sárga cink bevonat és fekete anodyzált alumínium alkatrészek</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance  Volkswagen Golf 4, csak 4-Motion, 1998.12-2003.11-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance--volkswagen-golf-4-csak-4-motion-1998-12-2003-11-ig-allithato-magassagu-futomu'),
(1307, '', '<br /><div>A Volkswagen Golf 4 4-Motion V-Maxx egy autó, melynek állítható magasságú sport futóműve van.</div><br />', 'V-Maxx Volkswagen Golf 4, csak 4-Motion, 1998.12-2003.11-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-4-csak-4-motion-1998-12-2003-11-ig-allithato-magassagu-futomu'),
(1308, '', '<p>Az MTS-Technik Sport sorozatú állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>Speciális Eibach rugók a maximális sportosság érdekében.</li>\n	<li>A Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is.</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 4, beleértve Variant, kivéve 4-Motion, 1997.09-2006.09-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-4-beleertve-variant-kiveve-4-motion-1997-09-2006-09-ig-sport-series-allithato-magassagu-futomu'),
(1309, '', '<div>\\n  <div>\\n    Az egyedi beállítási lehetőségeknek köszönhetően a Volkswagen Golf 4-hez tervezett V-Maxx futómű változatos magasság és keménység beállításokat tesz lehetővé.\\n  </div>\\n</div>', 'V-Maxx Volkswagen Golf 4, kivéve 4-Motion, 1998.12-2003.11-ig, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-4-kiveve-4-motion-1998-12-2003-11-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1310, '', '<div>\n  <p><em>A Volkswagen Golf 4 4-Motion V-Maxx sport futóműve állítható magasságú és keménységű.</em></p>\n</div>', 'V-Maxx Volkswagen Golf 4, csak 4-Motion, 1998.12-2003.11-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-4-csak-4-motion-1998-12-2003-11-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1311, '', '<div style=\"box-sizing:border-box; color:#424242; font-size:13.3333px; word-wrap:break-word\"><br /><p>Ez a magasságállítható futómű megfelel a Volkswagen Golf 4 típusnak, melynek kódja 1J, és alkalmas az 1997.10-től gyártott modellekre, kivéve a 4-Motion és Variant változatokat.</p><br /><ul><br /><li>Az elülső és hátsó tengelyterhelés egyaránt 1020 kg.</li><br /><li>Fontos, hogy az eredeti méretű abroncsok és felnik esetén nyomtávszélesítőre van szükség. 50 mm-nél nagyobb átmérőjű féltengellyel rendelkező modellek esetében javasolt a stabilizátorrúd cseréje a jobb oldali féltengely mozgásának biztosítása érdekében.</li><br /><li>A futóműkészlet rendelkezik német nyelvű TÜV engedéllyel, az engedély által meghatározott ültetés elöl 30-65 mm, míg hátul 30-65 mm között állítható. További ültetési lehetőségek: Elöl +45 mm, hátul +5 mm.</li><br /><li>A termék Németországban, az Ap-Fahrwerke gyárában készül, és 2 év garancia vonatkozik rá.</li><br /></ul><p><strong>Cikkszáma: GF10-005</strong></p><br /><p>Az ár egy szettre vonatkozik.</p><br />', 'AP made by KW Volkswagen Golf 4, kivéve Variant és 4-Motion, 1997.10-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-4-kiveve-variant-es-4-motion-1997-10-tol-allithato-magassagu-futomu'),
(1312, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett tökéletes választás a 2002-től készült Volkswagen Golf IV, Typ 1J, R32 modellekhez. Ezt a minőségi futóművet úgy tervezték, hogy javítsa az autó megjelenését és maximális vezetési élményt nyújtson. A szett lehetővé teszi az ültetés mértékének szabályozását 10 - 40 mm-el elöl és 10 - 30 mm-el hátul, így mindenki megtalálhatja a számára megfelelő beállítást.</p>\n<p>Ez a kiváló futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó kiváló vezethetőségéhez és stabilitásához.</p>\n<p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Ez a kiváló minőségű termék Made in Germany, és ideális választás minden olyan autótulajdonos számára, aki igényes a vezetési élményre és az autója megjelenésére.</p>\n<p>Cikkszám: 968364</p>', 'Vogtland Volkswagen Golf 4 R32, 2002.09-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-4-r32-2002-09-tol-allithato-magassagu-futomu'),
(1313, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a Volkswagen Golf IV típushoz, 1999-től gyártott modellekhez. A futóművet könnyedén beállíthatja 30-55 mm között az ön preferenciái szerint. A futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszere kiváló kényelmet és dinamikát biztosít. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó megjelenésének javításához és a vezetési élmény maximalizálásához.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a Vogtland már több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén. A futómű szett tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Ne feledje, hogy a termék Made in Germany, és a gyártó 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. Ha több információra van szüksége, tekintse meg az engedélyt <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF31_1549-10.pdf\" target=\"_blank\">itt</a>.</p>\n\n<p>Cikkszám: 968365</p>', 'Vogtland Volkswagen Golf 4 4-Motion, 4-5hengeres, beleértve Variant, 1999.04-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-4-4-motion-4-5hengeres-beleertve-variant-1999-04-tol-allithato-magassagu-futomu'),
(1314, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a 1999-től gyártott Volkswagen Golf IV típusú autókhoz lett tervezve. Ez a futómű kitűnő lehetőséget biztosít arra, hogy az autó megjelenése mellett a vezetési élményt is maximalizálja. Az ültetés mértéke 30-50 / 30-50 mm között állítható, lehetővé téve számodra, hogy saját elképzeléseid szerint finomhangold az autód magasságát.</p>\n\n<p>A futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, így hosszú távon is optimális teljesítményt nyújtanak.</p>\n\n<p>A futómű TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugók területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>A termék magas minőségét garantálja, hogy Made in Germany!</p>\n\n<p>Cikkszám: 968366</p>', 'Vogtland Volkswagen Golf 4 4-Motion, 6hengeres, beleértve Variant, 1999.05-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-4-4-motion-6hengeres-beleertve-variant-1999-05-tol-allithato-magassagu-futomu'),
(1315, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kompatibilis a Volkswagen Golf IV típusú autókkal, évjáratuk 1999 és 2004 közötti. Ez a minőségi futómű szett lehetővé teszi az autó megjelenésének javítását és optimális vezetési élmény nyújtását. Az ültetés mértéke 30-50 / 30-50 mm között állítható, így az egyéni igényeknek megfelelő beállításokat lehet végezni. A készlet tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n\n<p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A készlet általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak. A termék Made in Germany!</p>\n\n<p>Cikkszám: 968215</p>', 'Vogtland Volkswagen Golf 4 Variant, kivéve 4-Motion, 1999-2004-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-4-variant-kiveve-4-motion-1999-2004-ig-allithato-magassagu-futomu'),
(1316, '', '<p>A Vogtland által gyártott állítható magasságú futómű kit tökéletesen illeszkedik a Volkswagen Golf IV típusú autókhoz, 1997-től kezdve. Ennek az eszköznek az ültetési mértéke 30-50 mm lehet mind elöl, mind hátul. A futómű tartalmaz speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiemelkedő korrózióvédelemmel rendelkeznek.</p>\n\n<p>Ez a termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát nyújt az ültető rugókra és lengéscsillapítókra. A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintezővel vagy torziós futóművel vannak felszerelve.</p>\n\n<p>A Vogtland futóművek Németországban készülnek, és hosszú évek tapasztalatával rendelkező gyártó áll mögöttük. A termék cikkszáma: 968541.</p>', 'Vogtland Volkswagen Golf 4, kivéve 4-Motion, 1997.10-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-4-kiveve-4-motion-1997-10-tol-allithato-magassagu-futomu'),
(1317, '', '<p>Ez a magasságállítható AP-Fahrwerke futómű megfelel a következő Volkswagen Golf 4 Variant típusnak, kivéve a 4-Motion verziót, melyhez az évjáratnak 1999.05-től kell lennie. Az elülső tengelyterhelés 1020 kg, míg a hátsó tengelyterhelés 1080 kg. Fontos megjegyezni, hogy a gyári méretű gumiabroncsok és felnik esetén nyomtávszélesítő felszerelése szükséges. Modelleknél, melyeknél a 50 mm-nél nagyobb átmérőjű futóművet használnak, javasolt az anti-roll bar cseréje a jobb oldali féltengely mozgásának biztosítása érdekében. A cikkszámok: Xenon fényszóró nélküli modellekhez: ZB50-017, Xenon fényszórós modellekhez: ZB50-017.</p>\r\n<ul>\r\n	<li>A futóműszett rendelkezik német nyelvű TÜV engedéllyel.</li>\r\n	<li>Az engedély szerint az ültetés mértéke elöl 30-65 mm között, hátul szintén 30-65 mm között állítható. Ezen belül további állítási lehetőségek is vannak, azonban a TÜV engedély csak a fenti intervallumokat engedélyezi.</li>\r\n	<li>Extra ültetési lehetőség: elöl +45 mm, hátul +5 mm.</li>\r\n</ul>\r\n<ul>\r\n	<li>Gyártó: AP-Fahrwerke Németország</li>\r\n	<li>Garancia: 2 év</li>\r\n</ul>\r\n<p><strong>Cikkszám: GF82-002</strong></p>\r\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Volkswagen Golf 4 Variant, kivéve 4-Motion, 1999.04-től, AP állítható magasságú futómű állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-4-variant-kiveve-4-motion-1999-04-tol-ap-allithato-magassagu-futomu-allithato-magassagu-futomu'),
(1318, '', '<div>\n  <p>Ez az Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n  <ul>\n    <li>VW Golf 4 4WD, Limousine, Variant 4 és 5 hengeres</li>\n    <li>Tipuskód: 1J</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 1999.04-től</li>\n    <li>Tengelyterhelés elöl (kg): 1050</li>\n    <li>Tengelyterhelés hátul (kg): 1060</li>\n    <li>Egyéb kitételek: -</li>\n  </ul>\n  <ul>\n    <li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-55 mm, hátul: 30-55 mm tartományban állítható (nagyobb intervallumban is beállítható, de a TÜV engedély csak az említett beállításokra vonatkozik).</li>\n    <li>Lehetséges extra ültetés elöl: +20 mm, hátul: +0 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: Ap-Fahrwerke, Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF80-031</strong></p>\n  <p><br />\n  Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Volkswagen Golf 4 4-Motion, 4-5 hengeres, 1999.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-4-4-motion-4-5-hengeres-1999-04-tol-allithato-magassagu-futomu'),
(1319, '', '<p>Ez a magasságállítható futómű az alábbi autótípushoz illeszkedik:</p>\n\n<ul>\n	<li>Volkswagen Golf 4 4-Motion</li>\n	<li>Tipuskód: 1J</li>\n	<li>Csak 2.8 V6 4-Motion és R32 4-Motion</li>\n	<li>Évjárat: 1997.08-2007.12</li>\n	<li>Beleértve Variant</li>\n	<li>Egyéb kitételek: Az eredeti méretű gumik és felnik esetén nyomtávszélesítő felszerelése szükséges!<br />\n	Az 50 mm-nél nagyobb átmérőjű felni esetén javasolt a stabilizátorrúd cseréje! Ennek célja a jobb oldali féltengely szabad mozgásának biztosítása a futómű cseréje után. Az alkatrészek cikkszáma Xenon fényszóró nélküli modellekhez: ZB50-017, Xenon fényszórós modellekhez: ZB50-017.</li>\n</ul>\n\n<ul>\n	<li>Ez a futómű készlet rendelkezik német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-65 mm, hátul: 30-65 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>', 'AP made by KW Volkswagen Golf 4, 2.8 V6 4-Motion, 3.2 R32 4-Motion, beleértve Variant, 1997.08-2007.12-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-4-2-8-v6-4-motion-3-2-r32-4-motion-beleertve-variant-1997-08-2007-12-ig-allithato-magassagu-futomu'),
(1320, '', '<p>A Bilstein B14 állítható magasságú sport futómű egy olyan rendszer, amelyet a BILSTEIN mérnökei terveztek versenysport technológiával az utcára. A futómű egy egycsöves rendszer, amely Upside-Down technológiát alkalmaz. A versenysportrugók nagy szilárdságú anyagból készülnek, és állítható magasságot biztosítanak, melynek elemei alumíniumból készültek. A B14 PSS lehetővé teszi a jármű magasságának csökkentését akár 50 mm-rel az első és hátsó tengelyen belül egy 20 mm-es állítási tartományon belül. Az extrémen terhelhető egycsöves Upside-Down technológia gondoskodik a kiegyensúlyozott menetteljesítményről és a vezetés öröméről.</p>', 'Bilstein Volkswagen Golf 4 4-Motion, 1998.05-2005.06-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-4-4-motion-1998-05-2005-06-ig-bilstein-b14-allithato-magassagu-futomu'),
(1321, '', '<div><strong>VW Golf 4 Bilstein B14 sport futómű állítható magassággal</strong></div>  \n<div> </div>  \n<div>Az ültetés mértéke az első tengelyen: 25 - 45 mm</div>  \n<div>Az ültetés mértéke a hátsó tengelyen: 20 - 40 mm</div>  \n<div> </div>  \n<div>Első tengely terhelhetősége: 1060 kg</div>  \n<div>Hátsó tengely terhelhetősége: 1010 kg</div>  \n<div> </div>  \n<div>A futómű TÜV engedéllyel rendelkezik!</div>  \n<div> </div>  \n<div> </div>', 'Bilstein Volkswagen Golf 4, kivéve 4-Motion, 1997.08-2005.06-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-4-kiveve-4-motion-1997-08-2005-06-ig-bilstein-b14-allithato-magassagu-futomu'),
(1322, '', '<p>Ez az alkatrész kompatibilis a következő autótípussal:</p>\n<ul>\n	<li>Volkswagen Golf 5 Variant</li>\n	<li>Típuskód: 1K</li>\n	<li>Évjárat: 2003 - 2008</li>\n	<li>Kivéve 4-Motion</li>\n	<li>FIGYELEM! A futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), ami nem része ennek a szettnek!</li>\n	<li>Tengelyterhelés elöl: 1106 - 1200 kg</li>\n	<li>Tengelyterhelés hátul: 1250 kg</li>\n</ul>\n<ul>\n	<li>Gyártási hely: NÉMETORSZÁG</li>\n	<li>Ez a futómű rendelkezik <strong>TÜV</strong> engedéllyel, amit a csomagolás tartalmaz.</li>\n	<li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\n	<li>Kiváló minőség, rendkívül kedvező áron!!!</li>\n	<li>A szett tartalma: 4 db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal</li>\n</ul>', 'Jom Bochum Volkswagen Golf 5 Variant, kivéve 4-Motion, 2003-2008-ig, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-5-variant-kiveve-4-motion-2003-2008-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1323, '', 'Az alkatrész kompatibilis a Volkswagen Golf 5 autótípushoz, típuskódja 1K, gyártási éve 2003 és 2008 között. A futómű beszereléséhez rövidített stabilizátor rúdra van szükség, mely nem tartozéka a szettnek. Az elülső tengelyterhelés 1106-1200 kg, míg a hátsó tengelyterhelés 1250 kg. A futómű MADE IN GERMANY, TÜV engedéllyel rendelkezik, mely a csomagban megtalálható. 2 ÉV TELJESKÖRŰ GARANCIÁVAL!!! Kiemelkedő minőség, rendkívül kedvező áron! A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal és egy állítókulccsal.', 'Jom Bochum Volkswagen Golf 5, kivéve 4-Motion és Variant, 2003-2008-ig, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-5-kiveve-4-motion-es-variant-2003-2008-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1324, '', '<p>Ez a alkatrész illeszkedik a következő autótípushoz:</p> <ul> <li>Volkswagen Golf 5 4-Motion</li> <li>Típuskód: 1K</li> <li>Évjárat: 2003 - 2008</li> <li>Kivéve Variant</li> <li>FONTOS! Rövidített stabilizátor rúdra (kutyacsont) van szükség a futómű beszereléséhez, mely nem tartozék ebben a szettben!</li> <li>Tengelyterhelés elöl: 1200 kg</li> <li>Tengelyterhelés hátul: 1250 kg</li> </ul> <ul> <li>Gyártva Németországban</li> <li>Ez a futómű rendelkezik <strong>TÜV</strong> jóváhagyással, melyet a csomag tartalmaz</li> <li>2 ÉVES TELJESKÖRŰ GARANCIÁVAL!!!</li> <li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li> <li>A készlet tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</li> </ul>', 'Jom Bochum Volkswagen Golf 5 4-Motion, kivéve Variant, 2003-2008-ig, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-5-4-motion-kiveve-variant-2003-2008-ig-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(1325, '', '<p>Ez a termék kompatibilis a következő autótípussal:</p>\n<ul>\n	<li>Volkswagen Golf 5</li>\n	<li>Típuskód: 1K</li>\n	<li>Évjárat: 2003 - 2008</li>\n	<li>Kivéve a 4-Motion és a Variant modelleket</li>\n	<li>Fontos! A futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szettnek!</li>\n	<li>Tengelyterhelés elöl: 1105 kg</li>\n	<li>Tengelyterhelés hátul: 1250 kg</li>\n</ul>\n<ul>\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\n	<li>Ez a futómű rendelkezik <strong>TÜV</strong> engedéllyel, amelyet a csomag tartalmaz</li>\n	<li>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</li>\n	<li>Kiemelkedő minőség, lenyűgöző áron!</li>\n	<li>A szett tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal és 1 db állítókulccsal</li>\n</ul>', 'Jom Bochum Volkswagen Golf 5, kivéve 4-Motion és Variant, 2003-2008-ig, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-5-kiveve-4-motion-es-variant-2003-2008-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1326, '', 'Ez az alkatrész illeszkedik a következő autótípushoz:</p>  <ul> 	<li>Volkswagen Golf 5 Variant</li> 	<li>Típuskód: 1K</li> 	<li>Évjárat: 2003 - 2008</li> 	<li>Kivéve 4-Motion</li> 	<li>FONTOS! A futómű telepítéséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szettnek!!</li> 	<li>Tengelyterhelés elöl: 1105 kg</li> 	<li>Tengelyterhelés hátul: 1250 kg</li> </ul>  <ul> 	<li>Gyártási hely: NÉMETORSZÁG</li> 	<li>Ez a futómű rendelkezik<strong> TÜV</strong> minősítéssel, amelyet a csomag tartalmaz.</li> 	<li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li> 	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li> 	<li>A szett tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</li> </ul> ', 'Jom Bochum Volkswagen Golf 5 Variant, kivéve 4-Motion, 2003-2008-ig, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-5-variant-kiveve-4-motion-2003-2008-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1327, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); \nfont-family: OpenSans-Regular, sans-serif; \nfont-size: 13px; \nbox-sizing: border-box;\">\nA Volkswagen Golf 5 V-Maxx sport futóművének fő jellemzője az állítható magasságú kialakítás.\n</strong>', 'V-Maxx Volkswagen Golf 5, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion, 2003-2008-ig, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion-2003-2008-ig-50mm-szaratmer-allithato-magassagu-futomu'),
(1328, '', '<div>\\n<p>Egy állítható magasságú V-Maxx sport futóművel felszerelt Volkswagen Golf 5.</p>\\n', 'V-Maxx Volkswagen Golf 5, 1.4, 1.4TSi, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2003-2008-ig, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-4-1-4tsi-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2003-2008-ig-50mm-szaratmer-allithato-magassagu-futomu'),
(1329, '', '<div>A Volkswagen Golf 5 V-Maxx sport futóművének magassága változtatható.</div>', 'V-Maxx Volkswagen Golf 5, 1.4, 1.4TSi, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2003-2008-ig, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-4-1-4tsi-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2003-2008-ig-55mm-szaratmer-allithato-magassagu-futomu'),
(1330, '', '<div>\\n<strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">\\nA Volkswagen Golf 5 4-Motion V-Maxx sport futóműje lehetővé teszi a magasság állítását\\n</strong>', 'V-Maxx Volkswagen Golf 5, 2.0T 4-Motion, 2.0TDi 4-Motion, 2.0TDi DSG 4-Motion, 3.2 4-Motion, 2003-2008-ig, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-2-0t-4-motion-2-0tdi-4-motion-2-0tdi-dsg-4-motion-3-2-4-motion-2003-2008-ig-55mm-szaratmer-allithato-magassagu-futomu'),
(1331, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nOlyan sport futóművet kínálunk, amely lehetővé teszi a Volkswagen Golf 5 V-Maxx modelljének magasságának szabályozását.\n</strong>', 'V-Maxx Volkswagen Golf 5, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion, 2003-2008-ig, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion-2003-2008-ig-55mm-szaratmer-allithato-magassagu-futomu'),
(1332, '', '<br />    <div><br />        <strong>Eladó egy speciálisan beállítható magasságú sport futómű Volkswagen Golf 5-ös modellekhez</strong><br />    </div><br />', 'V-Maxx Volkswagen Golf 5, 2.0T 4-Motion, 2.0TDi 4-Motion, 2.0TDi DSG 4-Motion, 3.2 4-Motion, 2003-2008-ig, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-2-0t-4-motion-2-0tdi-4-motion-2-0tdi-dsg-4-motion-3-2-4-motion-2003-2008-ig-50mm-szaratmer-allithato-magassagu-futomu'),
(1333, '', '<p>Az Audi A3 MTS-Technik által kínált sport futóművek az alábbi típusokhoz alkalmazhatók:</p>\n<ul>\n	<li>Audi A3 (Typ: 8P)</li>\n	<li>Audi A3 Sportback (Typ: 8P)</li>\n	<li>Audi A3 Cabrio (Typ: 8P)</li>\n	<li>Első tengely terhelés: 1035kg</li>\n	<li>Hátsó tengely terhelés: 1150kg</li>\n	<li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n	<li>Ültetés mértéke elöl: 35-70mm</li>\n	<li>Ültetés mértéke hátul: 35-60mm</li>\n	<li>TÜV engedéllyel rendelkezik</li>\n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n<p>Az MTS-Technik sport futóművei ideálisak azoknak, akik számára fontos a minőség és az ár arányos megfelelés. A futómű magassága fokozatmentesen állítható, így könnyen alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 5, beleértve Golf Plus, 2003-tól, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-5-beleertve-golf-plus-2003-tol-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1334, '', '<p>Az Audi A3 MTS-Technik által készített állítható magasságú sport futóművek ideális választás azok számára, akik kiváló minőséget szeretnének megfizethető áron! Az MTS-Technik futóművei fokozatmentesen állítható magassággal rendelkeznek, így könnyedén igazíthatók az útviszonyokhoz. Az optimális egyensúly a rugók és a lengéscsillapítók között maximális kényelmet és teljesítményt biztosít.</p>\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság széles tartományban, általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Plug & Play készlet, nem szükséges módosítás az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 5, beleértve Golf Plus, 2003-tól, (első tengely terhelés 1036-1170kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-5-beleertve-golf-plus-2003-tol-els-tengely-terheles-1036-1170kg-street-series-allithato-magassagu-futomu'),
(1335, '', '<p><strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  \n<p>A <strong>MTS-Technik Sport sorozatú állítható sport futóművei</strong> ideális választás azoknak, akik nem akarnak kompromisszumot kötni! A magasság fokozatmentesen állítható, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. Az <strong>MTS-Technik Sport futóművei</strong> optimális összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. Széles ültetési tartomány és maximális vezetési élmény!</p>  \n<p>A következő modellekhez:</p>  \n<ul>  \n	<li><strong>Audi A3 (Típus: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>  \n	<li><strong>Audi A3 Sportback (Típus: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li>  \n	<li><strong>Audi A3 Cabrio (Típus: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li>  \n	<li>Első tengely terhelés: 1035 kg alatt</li>  \n	<li>Hátsó tengely terhelés: 1150 kg</li>  \n	<li>Első lengéscsillapító szár átmérője: 50/55 mm</li>  \n	<li>Ültetés mértéke elöl: 35-70 mm</li>  \n	<li>Ültetés mértéke hátul: 35-60 mm</li>  \n	<li>TÜV engedéllyel rendelkezik</li>  \n	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> \n</ul>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>  \n	<li>a <strong>Sport sorozat</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>  \n	<li>gáztöltetű lengéscsillapítók</li>  \n	<li>magas hatékonyság extrém igénybevétel mellett is</li>  \n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> \n</ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>  ', 'MTS-Technik by Nord Performance Volkswagen Golf 5, beleértve Golf Plus, 2003-tól, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-5-beleertve-golf-plus-2003-tol-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(1336, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható az útviszonyoknak megfelelően, így könnyedén beállítható az autó hasmagassága. Az MTS-Technik Sport futóművei optimális egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p>Az alábbi típusokhoz alkalmas:</p>\n<ul>\n    <li>Audi A3 (Typ: 8P)</li>\n    <li>Audi A3 Sportback (Typ: 8P)</li>\n    <li>Audi A3 Cabrio (Typ: 8P)</li>\n    <li>Első tengely terhelés: 1036-1170kg</li>\n    <li>Hátsó tengely terhelés: 1150kg</li>\n    <li>Első lengéscsillapító szár átmérője: 50/55mm</li>\n    <li>Ültetés mértéke elöl: 35-70mm</li>\n    <li>Ültetés mértéke hátul: 35-60mm</li>\n    <li>TÜV engedéllyel rendelkezik</li>\n    <li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n    <li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n    <li>speciális Eibach rugók a maximális sportosság érdekében</li>\n    <li>a Sport Series létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>\n    <li>gáztöltetű lengéscsillapítók</li>\n    <li>magas hatékonyság extrém igénybevétel mellett is</li>\n    <li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n    <li>tökéletes összhang rugó és lengéscsillapító között</li>\n    <li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 5, beleértve Golf Plus, 2003-tól, (első tengely terhelés 1036-1170kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-5-beleertve-golf-plus-2003-tol-els-tengely-terheles-1036-1170kg-sport-series-allithato-magassagu-futomu'),
(1337, '', '<div>\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">Az autó futóművét úgy lehet beállítani, hogy sportosabb legyen, és a magassága is állítható legyen a Volkswagen Golf 5-ös modellhez.</p>\n</div>', 'V-Maxx Volkswagen Golf 5, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion, 2003-2008-ig, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion-2003-2008-ig-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1338, '', '<br /><div><strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">Az állítható magasságú sport futóművel ellátott Volkswagen Golf 5 4-Motion V-Maxx kategóriájában kiemelkedő teljesítményt nyújt</strong></div> <br />', 'V-Maxx Volkswagen Golf 5, 2.0T 4-Motion, 2.0TDi 4-Motion, 2.0TDi DSG 4-Motion, 3.2 4-Motion, 2003-2008-ig, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-2-0t-4-motion-2-0tdi-4-motion-2-0tdi-dsg-4-motion-3-2-4-motion-2003-2008-ig-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1339, '', '<div>\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nA Volkswagen Golf 5 V-Maxx modellhez készült sport futómű, melynek magassága állítható. Ideális választás azoknak, akik szeretnének javítani az autó futómű teljesítményén és egyedi megjelenésén.\n</p>\n</div>', 'V-Maxx Volkswagen Golf 5, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion, 2003-2008-ig, 50mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion-2003-2008-ig-50mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1340, '', '</div>\\n<div>\\n<strong style=\\\\\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\\\\\">Módosítható magasságú sportos futómű megoldás a Volkswagen Golf 5-ös modellhez</strong>\\n</div>', 'V-Maxx Volkswagen Golf 5, 1.4, 1.4TSi, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2003-2008-ig, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-4-1-4tsi-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2003-2008-ig-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1341, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nAz állítható magasságú Volkswagen Golf 5 V-Maxx sport futómű leírása\n</strong>', 'V-Maxx Volkswagen Golf 5, 1.4, 1.4TSi, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2003-2008-ig, 50mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-1-4-1-4tsi-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2003-2008-ig-50mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1342, '', '<div>\\n<strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">\\nA Volkswagen Golf 5 4-Motion V-Maxx rendelkezik egy sportos futóművel.\\n</strong>', 'V-Maxx Volkswagen Golf 5, 2.0T 4-Motion, 2.0TDi 4-Motion, 2.0TDi DSG 4-Motion, 3.2 4-Motion, 2003-2008-ig, 50mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-5-2-0t-4-motion-2-0tdi-4-motion-2-0tdi-dsg-4-motion-3-2-4-motion-2003-2008-ig-50mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1343, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy a kívánt ültetést milliméterre pontosan beállítsa. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div>  \n<div>Az alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság összehangolása optimális felépítést eredményez.</div>  \n<ul>  \n	<li>Magas minőség alacsony áron</li>  \n	<li>Egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>  \n	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li>  \n	<li>Egyedülálló ár-érték arány</li>  \n	<li>Német minőség</li>  \n</ul>', 'AP made by KW Volkswagen Golf 5, 2005.08-tól, 50mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-5-2005-08-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(1344, '', '<div>Az Ap futómű a sportosan ambiciózus vezetők számára lehetőséget kínál arra, hogy milliméterre precízen beállítsák a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div>  <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div>  <ul> 	<li>kiváló minőség megfizethető áron</li> 	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>egyedülálló ár/érték arány</li> 	<li>német minőség</li> </ul>', 'AP made by KW Volkswagen Golf 5, 2005.08-tól, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-5-2005-08-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1345, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómű a következő autótípusba passzol:</p>  <ul> 	<li>Általános leírás az autótípusról és a futóműről</li> 	<li>Tipuskód: 8P</li> 	<li>Kivéve: Quattro</li> 	<li>Évjárat: 2003.03-tól</li> 	<li>Tengelyterhelés elöl (kg): 1170</li> 	<li>Tengelyterhelés hátul (kg): 1005</li> 	<li>Egyéb fontos információk az autótípusról és a futóműről</li> </ul>  <ul> 	<li>Ez az futóműszett Német nyelvű TÜV engedéllyel rendelkezik!</li> 	<li>Részletek az engedélyben meghatározott ültetés mértékéről</li> 	<li>Plussz ültetés lehetőség elöl és hátul</li> </ul>  <ul> 	<li>Made In Ap-Fahrwerke Németország</li> 	<li>Garancia erre a termékre: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-040</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div>  <div>Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezetőknek arra, hogy az általuk kívánt ültetést milliméter pontosan beállíthassák. A sportos irányíthatóságot és optimális vezetési magatartást kombinálva nyújtjuk, miközben maximalizáljuk az ültetést.</div>  <div>Egy alumínium rugótányér segítségével lehetséges a járműmagasság egyénileg történő beállítása a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes összehangolása az optimális felépítés biztosítékával.</div>  <ul> 	<li>Kiemelkedő minőség megfizethető áron</li> 	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li> 	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>Kivételes ár-érték arány</li> 	<li>Német minőség garantálva</li> </ul>', 'AP made by KW Volkswagen Golf 5, 2005.08-tól, 55mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-5-2005-08-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(1346, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû olyan Audi A3 típusokhoz passzol, mint a Limousine, Sportback, Első kerék hajtás. A futómű első lengéscsillapító átmérője 55mm.</p>  <ul> 	<li>Tipuskód: 8P</li> 	<li>Kivéve: Quattro</li> 	<li>Évjárat: 2003.03-tól</li> 	<li>Tengelyterhelés elöl (kg): 1170</li> 	<li>Tengelyterhelés hátul (kg): 1005</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!<br /> 	Csak 55mm átmérőjű első lengéscsillapitó-szár átmérőjű modellekhez.<br /> 	Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges !</li> </ul>  <ul> 	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszáma: GF10-040</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div>  <div>Az AP futómű lehetőséget kínál a sportosan ambiciózus vezetőknek a jármű ültetésének precíz beállítására, biztosítva a sportos irányíthatóságot és optimális vezetési élményt.</div>  <div>Egy alumínium rugótányér segítségével a járműmagasságot a TÜV által engedélyezett tartományban egyénileg beállíthatja, így garantálva a sportosságot, kényelmet és biztonságot.</div>  <ul> 	<li>Kiemelkedő minőség kedvező áron</li> 	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>Kiváló ár/érték arány</li> 	<li>Német minőség</li> </ul> ', 'AP made by KW Volkswagen Golf 5 Gti, 2.0 Turbo, beleértve DSG, 2004.12-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-5-gti-2-0-turbo-beleertve-dsg-2004-12-tol-allithato-magassagu-futomu'),
(1347, '', '<div><p>Egy olyan futóműről van szó, amely az alábbi autótípusokhoz passzol: Audi A3 Limousine, Sportback, Első kerék hajtás, Első lengéscsillapító átmérője: 55mm.</p>\n<ul>\n<li>Tipuskód: 8P</li>\n<li>Kivéve: Quattro</li>\n<li>Évjárat: 2003.03-tól</li>\n<li>Tengelyterhelés elöl (kg): 1170</li>\n<li>Tengelyterhelés hátul (kg): 1005</li>\n<li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!\nCsak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.\nMagnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges!</li>\n</ul>\n<ul>\n<li>Ez a futóműszett Német nyelvű TÜV engedéllyel rendelkezik!</li>\n<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható\n(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +0 mm</li>\n</ul>\n<ul>\n<li>Made In Ap-Fahrwerke Németország</li>\n<li>Garancia erre a termékre: 2 év</li>\n</ul>\n<p><strong>Cikkszáma: GF10-040</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>\n</div>\n<div>Ez a futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy pontosan beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kínáljuk a maximális ültetéshez kapcsolva.</div>\n<div>Egy alumínium rugótányér segítségével lehetséges a járműmagasságot a TÜV által engedélyezett tartományban egyénileg beállítani. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div>\n<ul>\n<li>kiváló minőség megfizethető áron</li>\n<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n<li>egyedülálló ár/érték arány</li>\n<li>német minőség</li>\n</ul>', 'AP made by KW Volkswagen Golf 5 R32, 2005.10-tő állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-5-r32-2005-10-t-allithato-magassagu-futomu'),
(1348, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>: 2003.01-tõl</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, a lengéscsillapító ház átmérõ 50 mm, az elsõ tengely terhelése legfeljebb 1060 kg, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (legfeljebb) 1060 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li> </ul> <p>Az autó megjelenését feldobja és kiváló vezetési élményt nyújt. A futómű szett lehetővé teszi az ültetés mértékének testreszabását. A kiváló minőségű futómű tartalmazza a magas teljesítményű lengéscsillapítókat, amelyek garantálják a kiegyensúlyozott kényelmet és a dinamikus vezetési élményt. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók biztosítják a tartósságot.</p> <p>A termék TÜV minősítéssel rendelkezik és 2 év garanciát kínál a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintező vagy torziós futóművel szerelt autókat.</p> <p>Készült Németországban!</p> <p>Cikkszám: 968230</p>', 'Vogtland Volkswagen Golf 5, beleértve Golf Plus, kivéve 4-Motion, 2003.10-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-5-beleertve-golf-plus-kiveve-4-motion-2003-10-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1349, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: AUDI A3</p>\n<ul>\n    <li><strong>Évjárat</strong>:2003.01-től</li>\n    <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>\n    <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése legfeljebb 1060 kg, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1060 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét a személyes igények szerint állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a tartóssághoz.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett alapértelmezetten 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Németországban gyártva!</p>\n<p>Cikkszám: 968231</p>', 'Vogtland Volkswagen Golf 5, beleértve Golf Plus, kivéve 4-Motion, 2003.10-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-5-beleertve-golf-plus-kiveve-4-motion-2003-10-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1350, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>: 2003.01-tõl</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, a lengéscsillapító ház átmérõ 50 mm, az elsõ tengely terhelése több mint 1060 kg, kivéve elektronikus lengéscsillapító, kivéve 4WD</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (több mint 1060 kg) 1170 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li> </ul> <p>Az autó külső megjelenésén javítva és kiváló vezetési élményt nyújtva a Vogtland állítható magasságú futómű szett ideális választás. A futómű lehetőséget biztosít az egyéni ültetési magasság beállítására. A speciális, nagy teljesítményű lengéscsillapítók kiegyensúlyozott kényelmet és dinamikus vezetési élményt nyújtanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelemmel ellátottak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra, amelynek több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén.</p> <p>A szett alapvetően 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező- vagy torziós futóművet használnak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968232</p>', 'Vogtland Volkswagen Golf 5, beleértve Golf Plus, kivéve 4-Motion, 2003.10-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-5-beleertve-golf-plus-kiveve-4-motion-2003-10-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1351, '', '<p><strong>Vogtland</strong><span> futómű átalakító készlet</span>: AUDI A3</p> <ul>     <li><strong>Évjárat</strong>: 2003.01-től</li>     <li><strong>Ültetés mértéke</strong>: 40 - 60 / 40 - 60 mm</li>     <li><strong>Típus</strong>: Audi A3, Typ 8P, beleértve Sportback, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése meghaladja a 1060 kg-ot, kivéve az elektronikus lengéscsillapítót, kivéve a 4WD-t</li>     <li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1060 kg) 1170 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li>     <li> </li> </ul> <p>Az autó megjelenésének javítása mellett ez a futómű készlet optimális vezetési élményt nyújt. A beállítások segítségével saját elképzeléseinek megfelelően módosíthatja az ültetés mértékét. Ez a kiváló minőségű futómű készlet csak speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A készlet alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autó típusoknál, amelyeknél szintező- vagy torziós futóművet szereltek fel.</p> <p>Németországban gyártva!</p> <p>Cikkszám: 968233</p>', 'Vogtland Volkswagen Golf 5, beleértve Golf Plus, kivéve 4-Motion, 2003.10-től, 55mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-5-beleertve-golf-plus-kiveve-4-motion-2003-10-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1352, '', '<p>Egy állítható magasságú sport futómű, melyet a VW Golf 6 JOM Blue Line típuskódú autókhoz terveztek. Gyártási éve 2008. novemberétől kezdődik. Fontos tudni, hogy a futómű beszereléséhez egyes modellek esetében rövidített stabilizátor rúdra lehet szükség, ami nem része ennek a szettnek. Az elülső tengelyterhelés 1106-1200 kg, míg a hátsóé 990 kg. Ez a futómű német TÜV engedéllyel rendelkezik, melyet a csomagolásban megtalál. Két év teljes körű garanciával kapható, és kiváló minőségű, rendkívül jó áron. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint egy állítókulcsot.</p>', 'Jom Bochum Volkswagen Golf 6, 1.9TDi / DSG, 2.0TDi / DSG, 2008-tól, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-6-1-9tdi--dsg-2-0tdi--dsg-2008-tol-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1353, '', '<p>Egy állítható magasságú sport futómű a VW Golf 6-hoz, mely a JOM Blue Line termékcsaládba tartozik.</p>\\r\\n\\r\\n<p>A futómű típuskódja: 1K</p>\\r\\n\\r\\n<p>Gyártási éve: 2008.11-től</p>\\r\\n\\r\\n<p>FONTOS! Az egyes modellekhez a futómű beszereléséhez szükséges lehet egy rövidített stabilizátor rúd (kutyacsont), mely nem része ennek a szettnek!</p>\\r\\n\\r\\n<p>Az elülső tengelyterhelés: 1105 kg</p>\\r\\n\\r\\n<p>A hátsó tengelyterhelés: 990 kg</p>\\r\\n\\r\\n<p>A termék GERMÁNYBAN KÉSZÜL</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomag tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>Kiváló minőségű termék hihetetlenül jó áron!</p>\\r\\n\\r\\n<p>A szett tartalma: 4 darab lengéscsillapító a hozzá tartozó rugókkal és 1 darab kulccsal az állításhoz.</p>\\r\\n', 'Jom Bochum Volkswagen Golf 6, 1.4, 1.4 TSi, 1.6, 2.0, 2.0T / DSG, 1.9TDi, 2008-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-6-1-4-1-4-tsi-1-6-2-0-2-0t--dsg-1-9tdi-2008-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1354, '', '<p>Egy állítható magasságú sport futómű, amely ideális választás lehet a VW Golf 6 Variant modellekhez (kivéve 4-Motion). Gyártási éve 2008.11-től. Fontos, hogy a beszereléshez némely modelleknél rövidített stabilizátor rúdra lehet szükség, ami nem része ennek a szettnek. A futómű MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 2 ÉV TELJESKÖRŰ GARANCIÁVAL ellátott. A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 kulcsot. Tengelyterhelés elöl: 1106 - 1200 kg, tengelyterhelés hátul: 1250 kg. Ne hagyja ki ezt a kiváló minőségű és megfizethető árú futóművet! </p>', 'Jom Bochum Volkswagen Golf 6 Variant, 1.4, 1.4 TSi, 1.6, 2.0, 2.0T / DSG, 1.9TDi, kivéve 4-Motion, 2008-tól, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-6-variant-1-4-1-4-tsi-1-6-2-0-2-0t--dsg-1-9tdi-kiveve-4-motion-2008-tol-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1355, '', '<p>Egy állítható magasságú sport futómű a VW Golf 6 Variant modellhez, melyet a JOM Blue Line sorozatában találsz. Ez a futómű kifejezetten a 1K Variant típusú modellekhez készült, kivéve a 4-Motion változatokat. Az évjáratától függően, 2008. novemberétől beszerezhető.</p>  <p>Fontos, hogy a futómű beszereléséhez egyes modelleknél szükséges lehet egy rövidített stabilizátor rúd, mely nem része ennek a szettnek!</p>  <p>Az első tengelyterhelés 1105 kg, míg a hátsó tengelyterhelés 1250 kg lehet ezzel a futóművel.</p>  <p>A termék MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalálsz.</p>  <p>2 ÉV TELJESKÖRŰ GARANCIÁVAL! Ez a futómű kiváló minőségű, és hihetetlenül jó áron kapható!</p>  <p>A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint egy kulcsot az állításhoz.</p>  ', 'Jom Bochum Volkswagen Golf 6 Variant, 1.4, 1.4 TSi, 1.6, 2.0, 2.0T / DSG, 1.9TDi, kivéve 4-Motion, 2008-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-6-variant-1-4-1-4-tsi-1-6-2-0-2-0t--dsg-1-9tdi-kiveve-4-motion-2008-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1356, '', '<p>Egy állítható magasságú sport futómű a VW Golf 6-hoz, mely a JOM Blue Line termékcsaládba tartozik. Ennek az autónak a típuskódja: 1K, és kizárólag a 4-Motion változatokhoz alkalmas. Az évjárata 2008.11-től kezdődik.</p>  <p>Fontos figyelmeztetés: Az esetek egy részében a futómű beszereléséhez rövidített stabilizátor rúdra lehet szükség (kutyacsont), ami nem része ennek a szettnek!</p>  <p>Az elülső tengelyterhelés 1200 kg, míg a hátsó tengelyterhelés 1250 kg.</p>  <p>Ez a termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomag tartalmaz.</p>  <p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>  <p>Kiemelkedő minőség, elképesztően jó áron!</p>  <p>A szett tartalma: 4 darab lengéscsillapító rugókkal, valamint 1 darab kulccsal az állításhoz.</p>', 'Jom Bochum Volkswagen Golf 6 4-Motion, 2.0TDi, 2008-tól, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-6-4-motion-2-0tdi-2008-tol-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(1357, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választásnak bizonyulnak azok számára, akik számára kiemelten fontos a kiváló minőség és az versenyképes ár. Az állítható magasság fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz, és beállíthatja az autó hasmagasságát. Az MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az Eibach gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Kiváló összhang a rugók és lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem szükséges módosításokat végezni a felfüggesztésen</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 6, beleértve Variant és Cabrio, 2008.11-től, (első tengely terhelés 1036-1100kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-6-beleertve-variant-es-cabrio-2008-11-tol-els-tengely-terheles-1036-1100kg-street-series-allithato-magassagu-futomu'),
(1358, '', '<p>Az MTS-Technik által kifejlesztett sport futóművek ideális választást jelentenek azoknak, akik minőségi és megfizethető árú terméket keresnek! A futómű magassága fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóművei kiemelkedő egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Főbb tulajdonságok:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> cég gyártja</li>\n	<li>A magasság széles skálán állítható, általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>A rugó és a lengéscsillapító tökéletes összhangban működik</li>\n	<li>A készlet könnyen beépíthető, nem szükséges módosításokat végezni az autó felfüggesztésén</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 6, beleértve Variant és Cabrio, 2008.11-től, (első tengely terhelés 1035kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-6-beleertve-variant-es-cabrio-2008-11-tol-els-tengely-terheles-1035kg-alatt-street-series-allithato-magassagu-futomu'),
(1359, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei kiváló választás azok számára, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport futóművei tökéletes egyensúlyt teremtenek az Eibach rugók és az MTS-Technik lengéscsillapítók között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p> <p>Az alábbi típusokhoz ajánlott:</p> <ul> <li>Audi A3 (Typ: 8P) - 1.2TSI, 1.4TFSI, 1.6, 1.6 E-Power, 1.6FSI, 1.8TFSI, 2.0FSI, 2.0TFSI, 1.6TDI, 2.0TDI, 1.8TFSI Quattro, 2.0TFSI Quattro, 3.2 V6 Quattro, 2.0TDI Quattro, S3 Quattro</li> <li>Audi A3 Sportback (Typ: 8P) - 1.2TSI, 1.4TFSI, 1.6, 1.8TFSI, 2.0FSI, 2.0TFSI, 1.6TDI, 1.9TDI, 2.0TDI, 1.8TFSI Quattro, 2.0TFSI Quattro, 3.2 V6 Quattro, 2.0TDI Quattro, S3 Quattro</li> <li>Audi A3 Cabrio (Typ: 8P) - 1.2TSI, 1.4TFSI, 1.6, 1.8TFSI, 2.0TFSI, 1.6TDI, 1.9TDI, 2.0TDI</li> <li>Első tengely terhelés: 1035kg alatt</li> <li>Hátsó tengely terhelés: 1150kg</li> <li>Első lengéscsillapító szár átmérője: 50/55mm</li> <li>Ültetés mértéke elöl: 35-70mm</li> <li>Ültetés mértéke hátul: 35-60mm</li> <li>TÜV engedéllyel rendelkezik</li> <li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul> <p><u>Termékjellemzők:</u></p> <ul> <li> Az állítható magasságú futóművek rugóit az Eibach gyártja</li> <li> Speciális Eibach rugók a maximális sportosság érdekében</li> <li> A Sport Series létrehozásánál a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li> <li> Gáztöltetes lengéscsillapítók</li> <li> Magas hatékonyság extrém igénybevétel mellett is</li> <li> Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> <li> Tökéletes összhang rugó és lengéscsillapító között</li> <li> A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul> <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 6, beleértve Variant és Cabrio, 2008.11-től, (első tengely terhelés 1035kg alatt), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-6-beleertve-variant-es-cabrio-2008-11-tol-els-tengely-terheles-1035kg-alatt-sport-series-allithato-magassagu-futomu'),
(1360, '', '<p><strong>Audi A3 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futóművei</strong> tökéletes választás azok számára, akik nem akarnak kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága ezzel a fokozatmentesen állítható magassággal. Az <strong>MTS-Technik Sport futóművein</strong>él optimális összhangban vannak az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong>. Széles ültetési tartomány és maximális vezetési élmény!</p>  <p>A következő modellekhez:</p>  <ul> 	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.6 E-Power / 1.6FSI / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0FSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI / 1.8TFSI Quattro / 2.0TFSI Quattro / 3.2 V6 Quattro / 2.0TDI Quattro / S3 Quattro</li> 	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI / 1.4TFSI / 1.6 / 1.8TFSI / 2.0TFSI / 1.6TDI / 1.9TDI / 2.0TDI</li> 	<li>Első tengely terhelés: 1036-1170kg</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elöl: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li> 	<li>a <strong>Sport sorozat</strong> létrehozásakor a szélesebb ültetési tartomány és a fokozott vezetési élmény volt a cél</li> 	<li>gáztöltéses lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Golf 6, beleértve Variant és Cabrio, 2008.11-től, (első tengely terhelés 1036-1100kg), Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-6-beleertve-variant-es-cabrio-2008-11-tol-els-tengely-terheles-1036-1100kg-sport-series-allithato-magassagu-futomu'),
(1361, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípusnak:</p>  <ul> 	<li>VW Golf 6-hoz, lengéscsillapító átmérője: 50mm</li> 	<li>Tipuskód: 1K, 1KP</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2008.10-től</li> 	<li>Tengelyterhelés elöl (kg): 1060</li> 	<li>Tengelyterhelés hátul (kg): 1000</li> 	<li>Egyéb kitételek: Kivéve négykerék-meghajtású modelleknél!<br /> 	Csak 50mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li> </ul>  <ul> 	<li>Ez a futóműszett német nyelvű TÜV engedéllyel rendelkezik!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +5 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke, Made In Németország</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF81-021</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Volkswagen Golf 6, 2008.10-től, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-6-2008-10-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1362, '', '<p>Ez az állítható magasságú AP-Fahrwerke futómű megfelel a következő autótípusnak:</p>\n<ul>\n	<li>VW Golf 6</li>\n	<li>Lengéscsillapító átmérője: 50mm</li>\n	<li>Tipuskód: 1K, 1KP</li>\n	<li>Évjárat: 2008.10-től</li>\n	<li>Tengelyterhelés elöl: 1170 kg</li>\n	<li>Tengelyterhelés hátul: 1000 kg</li>\n	<li>Egyéb információk: Kivéve négykerék-meghajtású modellek! Csak 50mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li>\n</ul>\n<ul>\n	<li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható (Nagyobb intervallumban is állítható, de a TÜV engedély csak a fenti beállításokat engedélyezi.)</li>\n	<li>Extra ültetési lehetőség elöl: +10 mm, hátul: +5 mm</li>\n</ul>\n<ul>\n	<li>Termék helye: Ap-Fahrwerke, Németország</li>\n	<li>Garancia: 2 év</li>\n</ul>\n<p><strong>Cikkszám: GF81-022</strong></p>\n<p><br /> Az ár egy szettre vonatkozik!</p>', 'AP made by KW Volkswagen Golf 6, 2008.10-től, 50mm szárátmérő, (első tengely terhelés 1061-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-6-2008-10-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-ig-allithato-magassagu-futomu'),
(1363, '', '<div>\n  <p>Ez az állítható magasságú AP-Fahrwerke futómű megfelel a következő autótípusnak:</p>\n  <ul>\n    <li>Volkswagen Golf 6, beleértve a GTI-t, a lengéscsillapító átmérője: 55mm</li>\n    <li>Tipuskód: 1K, 1KP</li>\n    <li>Típus variáció:</li>\n    <li>Évjárat: 2008.10-től</li>\n    <li>Tengelyterhelés elöl (kg): 1060</li>\n    <li>Tengelyterhelés hátul (kg): 1000</li>\n    <li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!<br /> Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li>\n  </ul>\n  <ul>\n    <li>Az AP-Fahrwerke futómű német nyelvű TÜV engedéllyel rendelkezik!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 35-65 mm között állítható<br />(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n    <li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +5 mm</li>\n  </ul>\n  <ul>\n    <li>Gyártó: AP-Fahrwerke, Németország</li>\n    <li>Garancia: 2 év</li>\n  </ul>\n  <p><strong>Cikkszám: GF81-031</strong></p>\n  <p><br /> Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Volkswagen Golf 6, 2008.10-től, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-6-2008-10-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1364, '', '<p>Ez az állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>VW Golf 6, beleértve a GTD-t és GTI-t, 55 mm átmérőjű lengéscsillapítóval</li>\\r\\n	<li>Tipuskód: 1K, 1KP</li>\\r\\n	<li>Évjárat: 2008.10-től</li>\\r\\n	<li>Tengelyterhelés elöl (kg): 1170</li>\\r\\n	<li>Tengelyterhelés hátul (kg): 1000</li>\\r\\n	<li>Egyéb megjegyzés: Kivéve a négykerék-meghajtású modelleket!<br />\\r\\n	Csak olyan modellekhez, melyeknél az első lengéscsillapító szára 55 mm átmérőjű.</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyezett ültetési tartomány elöl: 35-65 mm, hátul: 35-65 mm között állítható<br />\\r\\n	(Mindig nagyobb intervallumban is beállítható a futómű, de a TÜV engedély csak a fent említett beállításokra érvényes.)</li>\\r\\n	<li>Plusz ültetési lehetőség elöl: +10 mm, hátul: +5 mm</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártva az Ap-Fahrwerke Németország által</li>\\r\\n	<li>Garancia: 2 év ezen termékre</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: </strong>11581032<br />\\r\\nAz ár egy szettre vonatkozik!</p>\\r\\n', 'AP made by KW Volkswagen Golf 6, beleértve GTD és GTi, 2008.10-től, 55mm szárátmérő, (első tengely terhelés 1060-1170kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-6-beleertve-gtd-es-gti-2008-10-tol-55mm-szaratmer-els-tengely-terheles-1060-1170kg-ig-allithato-magassagu-futomu'),
(1365, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû kompatibilis az alábbi autótípusokkal:</p> <ul> <li>Audi A3 Limousine, Sportback, Elsõ kerék hajtás, Elsõ lengéscsillapító átmérõ: 55mm</li> <li>Tipuskód: 8P</li> <li>Kivéve: Quattro</li> <li>Évjárat: 2003.03-tól</li> <li>Tengelyterhelés elöl (kg): 1170</li> <li>Tengelyterhelés hátul (kg): 1005</li> <li>Egyéb kitételek: Kivéve négykerék-meghajtású modellek!<br /> Csak 55mm átmérõjû elsõ lengéscsillapitó-szár átmérõjû modellekhez.<br /> Magnetride elektromágneses futómûvel ellátott Audi modelleknél a vezérlõegység deakitválása szükséges !</li> </ul> <ul> <li>Ez az futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li> <li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 40-60 mm között állítható<br /> (Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> <li>Plussz ültetés lehetõség elöl: +10 mm, hátul: +0 mm</li> </ul> <ul> <li>Gyártó: Ap-Fahrwerke, Németország</li> <li>Garancia: 2 év</li> </ul> <p><strong>Cikkszám: GF10-040</strong></p> <p><br /> Az ár 1 szettre vonatkozik!</p> </div> <div>Az AP futómû lehetõséget kínál a sportosan ambiciózus vezetõk számára, hogy precízen beállítsák az általuk kívánt ültetést. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk a maximális ültetéssel összekötve.</div> <div>Egy alumínium rugótányér segítségével a jármûmagasságot a TÜV által engedélyezett tartományban egyénileg beállíthatja. A sportosság, a kényelem és a biztonság párhuzamos összehangolása egy optimális felépítést biztosít.</div> <ul> <li>Kiváló minõség megfizethetõ áron</li> <li>Egyedi magasság beállítás a TÜV által engedélyezett tartományban</li> <li>Kiváló minõségű alkatrészek és TÜV tanúsítvány</li> <li>Egyedülálló ár/érték arány</li> <li>Német minõség</li> </ul>', 'AP made by KW Volkswagen Golf 6 4-Motion, beleértve R és Variant, 2008.10-től, 55mm szárátmérő, (első tengely terhelés 1120kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-6-4-motion-beleertve-r-es-variant-2008-10-tol-55mm-szaratmer-els-tengely-terheles-1120kg-alatt-allithato-magassagu-futomu'),
(1366, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a 2008-tól gyártott Volkswagen Golf VI modellekhez. A futómű lehetővé teszi az autó megjelenésének javítását és a maximális vezetési élmény biztosítását. Az ültetés mértéke széles skálán állítható, lehetőséget adva a személyre szabásra. A futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és TÜV minősítéssel ellátottak.</p>\n<p>A Vogtland futómű szettje Made in Germany és 2 év garanciát biztosít az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p><strong>Cikkszám:</strong> 968689</p>', 'Vogtland Volkswagen Golf 6, beleértve GTi, kivéve DDC futóművel, 2008-tól, 55mm szárátmérő, (első tengely terhelés: 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-beleertve-gti-kiveve-ddc-futomuvel-2008-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1367, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelel a Volkswagen Golf 6 autókhoz, évjárattól 2008-tól. Az ültetés mértéke 35-65 mm, a lengéscsillapító ház átmérője 50 mm, az első tengely terhelése több mint 1060 kg. A maximális tengelyterhelés elől 1170 kg, hátul pedig 1000 kg. A futómű szett csak speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak. A termék TÜV minősítéssel rendelkezik, és 2 év garanciát biztosít az ültető rugókra és lengéscsillapítókra. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve a szintezős vagy torziós futóművel szerelt autókat. Made in Germany! Cikkszám: 968688</p>', 'Vogtland Volkswagen Golf 6, kivéve DDC futóművel, 2008-tól, 50mm szárátmérő, (első tengely terhelés: 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-kiveve-ddc-futomuvel-2008-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1368, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kompatibilis a VOLKSWAGEN GOLF 6 modellel. Az évjárat 2009-től kezdődik, az ültetés mértéke pedig 35 - 65 mm lehet. A Volkswagen Golf VI Cabrio, Typ 1K típusú autókhoz tervezett futóműszett a lengéscsillapító ház átmérője 50 mm. Az elülső tengely maximális terhelhetősége 1090 kg, míg a hátsó tengelyé 1150 kg.</p>  \n<p>Ez a minőségi futómű szett nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetés mértékét a felhasználó saját elképzelése alapján állíthatja be. A speciális futómű tartalmaz kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>A termék Made in Germany!</p>  \n<p>Cikkszám: 968275</p>  ', 'Vogtland Volkswagen Golf 6 Cabrio, 2009.05-től, 50mm szárátmérő, (első tengely terhelés 1090kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-cabrio-2009-05-tol-50mm-szaratmer-els-tengely-terheles-1090kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1369, '', '<p>Egy állítható magasságú futómű szett a Volkswagen Golf 6-hoz, mely javítja az autó megjelenését és maximalizálja a vezetési élményt. A futómű tartalmaz speciális kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, ami kiegyensúlyozott komfortot és fokozott dinamikát biztosít. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintező- vagy torziós futóművel szerelt autókat.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968690</p>', 'Vogtland Volkswagen Golf 6, beleértve GTi, kivéve DDC futóművel, 2008-tól, 55mm szárátmérő, (első tengely terhelés: 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-beleertve-gti-kiveve-ddc-futomuvel-2008-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1370, '', '<p>A Vogtland által készített állítható magasságú futómű szett tökéletes választás a 2009-től gyártott Volkswagen Golf VI típusú autókhoz. Ez a minőségi futómű szett lehetővé teszi az autó megjelenésének javítását és maximális vezetési élmény biztosítását. Az ültetés mértéke 35-65 mm között szabályozható, így mindenki személyes igényeinek megfelelően alakíthatja autója magasságát. A készlet tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és dinamikus vezetési élményt nyújtanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is megőrzik minőségüket.</p>\n<p>Ez a termék rendelkezik TÜV minősítéssel, így biztos lehet benne, hogy megfelel a szigorú biztonsági és minőségi előírásoknak. A Vogtland cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Ne feledje, ez a termék Made in Germany - tehát a minőség és megbízhatóság garantált! Cikkszám: 968276</p>', 'Vogtland Volkswagen Golf 6 Cabrio, 2009.05-től, 55mm szárátmérő, (első tengely terhelés 1090kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-cabrio-2009-05-tol-55mm-szaratmer-els-tengely-terheles-1090kg-alatt-allithato-magassagu-futomu'),
(1371, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelel a Volkswagen Golf VI típusú autókhoz, melyek gyártási éve 2008-tól kezdődnek. A futómű beállítási lehetőségei 35-65 mm között mozognak, és az első tengely maximális terhelése 1060 kg. A futómű speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és TÜV minősítéssel rendelkeznek.</p>\n\n<p>A futómű szett alapjáraton 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autókat, amelyeknél szintezős vagy torziós futóművet alkalmaznak. A gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A termék az alapjáraton Németországban készül, és a cikkszáma: 968687.</p>', 'Vogtland Volkswagen Golf 6, kivéve DDC futóművel, 2008-tól, 50mm szárátmérő, (első tengely terhelés: 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-kiveve-ddc-futomuvel-2008-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1372, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN GOLF 6</p>  \n<ul> 	\n<li><strong>Évjárat</strong>: 2009-től</li> 	\n<li><strong>Ültetés mértéke:</strong> 20 - 40 / 20 - 40 mm</li> 	\n<li><strong>Típus</strong>: Volkswagen Golf VI R, a lengéscsillapító ház átmérője 55 mm</li> 	\n<li><strong>Max. tengelyterhelés elöl</strong>: 1110 kg</li> 	\n<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> 	\n<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf</a></li> \n</ul>  \n<p>Megjelenése javítása mellett ez a futómű szett optimális vezetési élményt nyújt. Az ültetés mértékét egyéni elképzelései szerint állíthatja be. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek a alacsony nyomású gázrendszer révén garantálják az egyensúlyt kényelem és dinamizmus között. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát nyújt az ültetőrugókra és a lengéscsillapítókra!</p>  \n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>Gyártva Németországban!</p>  \n<p>Cikkszám: 968187</p> ', 'Vogtland Volkswagen Golf 6 4-Motion, beleértve R, kivéve DDC futóművel, 2009.10-től, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-4-motion-beleertve-r-kiveve-ddc-futomuvel-2009-10-tol-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1373, '', '<p>A Vogtland által készített állítható magasságú futómű szett, melyet a Volkswagen Golf VI típushoz terveztek, lehetővé teszi az autó megjelenésének javítását és maximális vezetési élmény biztosítását. Az ültetés mértéke 35 - 65 mm között állítható, a lengéscsillapító ház átmérője 50 mm, az első tengely maximális terhelése 1060 kg, és DDC futóművel szerelt típusokhoz alkalmazható. A készlet tartalmazza a DDC deaktiváló szettet is.</p>\n<p>Ez a minőségi futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és TÜV minősítéssel rendelkeznek. A gyártó cég több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, és 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapesetben 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968271</p>', 'Vogtland Volkswagen Golf 6, csak DDC futóművel szerelt, 2008-tól, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-csak-ddc-futomuvel-szerelt-2008-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1374, '', '<strong>Vogtland</strong> állítható magasságú futómû szett a VOLKSWAGEN GOLF 6-hoz</p>  <ul> 	<li><strong>Évjárat</strong>: 2008-tól</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VI, Typ 1K, 1KP, beleértve GTI, kivéve 4WD, a lengéscsillapító ház átmérõ 55 mm, DDC futómûvel szerelt típusokhoz</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1060 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1000 kg</li> 	<li><strong>A készlet a DDC deaktiváló szettet tartalmazza!</strong></li> </ul>  <p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem maximalizálja a vezetési élményt is. Az ültetés mértékét az egyedi igényeknek megfelelően lehet beállítani. Ez a kitűnő minőségű futómű szett kétcsöves lengéscsillapítókkal van ellátva, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott kényelmet és a fokozott dinamikát. Emellett a lengéscsillapítók rendkívül ellenállók a korróziónak.</p>  <p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek más típusú futóművel vannak szerelve.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968272</p> ', 'Vogtland Volkswagen Golf 6, beleértve GTi, csak DDC futóművel szerelt, kivéve 4-Motion, 2008-tól, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-beleertve-gti-csak-ddc-futomuvel-szerelt-kiveve-4-motion-2008-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1375, '', '<p>A Vogtland által készített állítható magasságú futómű szett speciálisan a Volkswagen Golf VI típusú autók számára lett tervezve, kivéve a 4WD modelleket. Ez a futómű szett lehetővé teszi az autó magasságának szabályozását 35-65 mm tartományban. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak a alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak és a TÜV minősítéssel rendelkeznek.</p>\n\n<p>Ez a minőségi futómű szett optimális vezetési élményt kínál, miközben javítja az autó megjelenését. Az ültető rugók és lengéscsillapítók gyártója több mint 100 éves tapasztalattal rendelkezik a rugók területén, és 2 év garanciát biztosít ezekre az alkatrészekre.</p>\n\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyeknél szintezős vagy torziós futóművet alkalmaznak. A futóművet Németországban gyártják, és a cikkszáma: 968274.</p>', 'Vogtland Volkswagen Golf 6, csak DDC futóművel szerelt, 2008-tól, 55mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-csak-ddc-futomuvel-szerelt-2008-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1376, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN GOLF 6</p>  <ul> 	<li><strong>Évjárat</strong>: 2008-tól</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li> 	<li><strong>A készlet a DDC deaktiváló szettet tartalmazza!</strong></li> 	<li><strong>Típus</strong>: Volkswagen Golf VI, Typ 1K, 1KP, kivéve 4WD, az első tengely terhelése több mint 1060 kg, a lengéscsillapító ház átmérő 50 mm, DDC futóművel szerelt típusokhoz</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (több mint 1060 kg) 1170 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1000 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW810GF21-22-30-31-32_1531-10.pdf</a></li> </ul>  <p>Emellett, hogy a jármű megjelenését fokozza, ez a futómű szett optimális vezetési élményt nyújt. Az ültetés mértékét egyéni elképzelése szerint állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968273</p> ', 'Vogtland Volkswagen Golf 6, csak DDC futóművel szerelt, 2008-tól, 50mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-csak-ddc-futomuvel-szerelt-2008-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1377, '', '<strong>Vogtland</strong> állítható magasságú futómû szett: VOLKSWAGEN GOLF 6</p>  <ul> 	<li><strong>Évjárat</strong>: 2009-tõl</li> 	<li><strong>Ültetés mértéke:</strong> 20 - 40 / 20 - 40 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VI, Typ 1K, 1KP, 4WD, beleértve R, beleértve elektronikus lengéscsillapító</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1110 kg</li> 	<li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li> 	<li><strong>A szett a DDC deaktiváló készletet tartalmazza!</strong></li> </ul>  <p>A Vogtland állítható magasságú futómű szettje nemcsak esztétikailag javítja az autó megjelenését, hanem optimalizálja a vezetési élményt is. Lehetőség van az ültetés mértékének személyre szabására. Ez a prémium minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak a alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968278</p> ', 'Vogtland Volkswagen Golf 6 4-Motion, DDC futóművel szerelt, beleértve R, 2009-től, (első tengely terhelés 1061-1110kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-6-4-motion-ddc-futomuvel-szerelt-beleertve-r-2009-tol-els-tengely-terheles-1061-1110kg-allithato-magassagu-futomu'),
(1378, '', '<p>Egy állítható magasságú sport futóművet kínálunk Volkswagen Golf 7 JOM BlueLine modellhez. Ez a futómű ideális választás az 2013.05-től gyártott AU típusú autókhoz. A futómű tengelyterhelése elöl 965kg, hátul pedig 980kg. Fontos megjegyezni, hogy ez a futómű nem kompatibilis Multilink futóművel szerelt típusokhoz. A termék MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett a futóműre 2 ÉV TELJESKÖRŰ GARANCIA vonatkozik. A szett tartalmazza 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot. Ne hagyja ki ezt kiváló minőségű és megfizethető áron kapható ajánlatot!</p>', 'Jom Bochum Volkswagen Golf 7, kivéve Multilink futóművel szerelt, 2013.05-től, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-7-kiveve-multilink-futomuvel-szerelt-2013-05-tol-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(1379, '', '<p>Egy állítható magasságú sport futómű, melyet a Volkswagen Golf 7 JOM BlueLine modellhez terveztek. Gyártási év: 2013.05-től. Az AU típusú autókhoz passzol. Első tengelyterhelés: 1080kg, hátsó tengelyterhelés: 980kg. Fontos: kizárólag Multilink hátsó futóműves modellekhez ajánlott. Németországban gyártva. A futómű rendelkezik német nyelvű TÜV engedéllyel, mely csomagoláson belül található. 2 év teljeskörű garanciával! Kiemelkedő minőség, páratlan ár-érték arány! A szett tartalmaz 4 lengéscsillapítót rugókkal, valamint 1 állítókulcsot.</p>', 'Jom Bochum Volkswagen Golf 7, csak Multilink futóműhöz, 2013.05-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-7-csak-multilink-futomuhoz-2013-05-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1380, '', '<p>A Volkswagen Golf 7 JOM BlueLine sport futóműve állítható magassággal.</p>  <p>Ez a futómű 2013.05-től gyártott modellekre alkalmas (Typ.: AU).</p>  <p>Az elülső tengelyterhelés 966-1080kg, míg a hátsó tengelyterhelés 980kg.</p>  <p>Fontos: Ez a futómű nem kompatibilis Multilink futóművel szerelt típusokkal!</p>  <p>A termék MADE IN GERMANY és rendelkezik német TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>  <p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!</p>  <p>Kiemelkedő minőség és nagyszerű ár-érték arány jellemzi!</p>  <p>A szett tartalmaz 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 állítókulcsot.</p> ', 'Jom Bochum Volkswagen Golf 7, kivéve Multilink futóművel szerelt, 2013.05-től, (első tengely terhelés 966-1080kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-7-kiveve-multilink-futomuvel-szerelt-2013-05-tol-els-tengely-terheles-966-1080kg-allithato-magassagu-futomu'),
(1381, '', '<p>Az állítható magasságú sport futóművek ideális választást nyújtanak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Az MTS-Technik futóművei lehetővé teszik a magasság fokozatmentes beállítását, így könnyedén alkalmazkodhatnak az útviszonyokhoz, és optimalizálható az autó hasmagassága.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>TÜV engedéllyel rendelkeznek</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózió ellen (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 7, beleértve Variant, kivéve MultiLink futóművel szerelt, 2012.08-tól, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-7-beleertve-variant-kiveve-multilink-futomuvel-szerelt-2012-08-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(1382, '', '<p>A MTS-Technik által készített állítható magasságú sport futóművek ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és a megfizethető árat. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága, mivel fokozatmentesen állítható magassággal rendelkeznek. Az MTS-Technik futóművei a rugók és lengéscsillapítók optimális egyensúlyát biztosítják.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A rugókat az Eibach gyártja</li> 	<li>A termék rendelkezik TÜV engedéllyel</li> 	<li>A magasságot általában 25 és 80 mm között lehet szabadon állítani</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li> 	<li>A készlet könnyen beépíthető, nem szükséges módosítás az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 7, beleértve Variant, csak MultiLink futóművel szerelt, 2012.08-tól, (első tengely terhelés 980kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-7-beleertve-variant-csak-multilink-futomuvel-szerelt-2012-08-tol-els-tengely-terheles-980kg-alatt-allithato-magassagu-futomu'),
(1383, '', '<p>Az MTS-Technik által készített állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és a versenyképes ár. Az útviszonyoknak megfelelően könnyedén állítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik sport futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A termék TÜV engedéllyel rendelkezik</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 7, beleértve Variant, csak MultiLink futóművel szerelt, 2012.08-tól, (első tengely terhelés 981-1180kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-7-beleertve-variant-csak-multilink-futomuvel-szerelt-2012-08-tol-els-tengely-terheles-981-1180kg-allithato-magassagu-futomu'),
(1384, '', '<p>Az MTS-Technik által kínált állítható magasságú sport futóművek ideális választás azok számára, akik értékelik a kiváló minőséget és a versenyképes árat! A futómű magassága fokozatmentesen állítható, lehetővé téve az könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóművei egyensúlyban tartják a rugókat és a lengéscsillapítókat.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém terhelés mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>Plug & play készlet, nem szükséges módosítás az autó felfüggesztésén</li> </ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 7, beleértve Variant, kivéve MultiLink futóművel szerelt, 2012.08-tól, (első tengely terhelés 981-1140kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-7-beleertve-variant-kiveve-multilink-futomuvel-szerelt-2012-08-tol-els-tengely-terheles-981-1140kg-allithato-magassagu-futomu'),
(1385, '', ' </p>  <p><strong>Volkswagen Golf 7 V-Maxx állítható magasságú sport futómû</strong></p>  <p>2012 októberétől gyártva</p>  <p>Csak Multilink felfüggesztéssel rendelkezik</p>  <p>Első tengely maximális terhelése: 966-1010kg</p>  <p>Hátsó tengely terhelés korlátozása: 1070kg alatt</p>  <p>Lefedetes TÜV engedéllyel</p>  <p>Elülső üléspozíció csökkentése: 30-65mm között</p>  <p>Hátsó üléspozíció csökkentése: 45-65mm között</p>  ', 'V-Maxx Volkswagen Golf 7, csak Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 966-1010kg), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-csak-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-966-1010kg-50mm-szaratmer-allithato-magassagu-futomu'),
(1386, '', '<strong>Volkswagen Golf 7 V-Maxx állítható magasságú sport futómű</strong></p>  <p>Az autó gyártási éve 2012 októbere után kezdődik</p>  <p>Az autó Multilink futóművet kap</p>  <p>Az első tengely terhelése 965kg alatt van</p>  <p>A hátsó tengely terhelése 980kg alatt van</p>  <p>A futómű TÜV engedéllyel rendelkezik</p>  <p>Az ültetés mértéke elöl 30-65mm, míg hátul 45-65mm lehetőséget biztosít</p> ', 'V-Maxx Volkswagen Golf 7, kivéve Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 965kg alatt), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-kiveve-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-965kg-alatt-55mm-szaratmer-allithato-magassagu-futomu'),
(1387, '', '<p>Egy olyan sport futómű, amely állítható magassággal rendelkezik a Volkswagen Golf 7-hez.</p> <p>Ez a futómű az 2012. októberétől gyártott modelleken működik, kivéve azokat, amelyek Multilink futóművet használnak.</p> <p>Az első tengely terhelése legfeljebb 965 kg lehet, míg a hátsó tengely terhelése maximum 980 kg.</p> <p>Ez a futómű rendelkezik TÜV engedéllyel, ami garanciát jelent a minőségre.</p> <p>Az ültetés mértéke az első részen 30-65 mm között változtatható, míg a hátsó részen 45-65 mm között lehet beállítani.</p>', 'V-Maxx Volkswagen Golf 7, kivéve Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 965kg alatt), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-kiveve-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-965kg-alatt-50mm-szaratmer-allithato-magassagu-futomu'),
(1388, '', '<p>A Volkswagen Golf 7 V-Maxx sport futóműve állítható magasságú. Az autó évjárata 2012.10-től, és csak Multilink futóművel rendelkezik. Az első tengely terhelése 965 kg alatt, míg a hátsó tengely terhelése 1070 kg alatt van. Fontos megjegyezni, hogy TÜV engedéllyel rendelkezik. Az ültetés mértéke elől 30-65 mm, míg hátul 45-65 mm.</p>', 'V-Maxx Volkswagen Golf 7, csak Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 965kg alatt), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-csak-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-965kg-alatt-50mm-szaratmer-allithato-magassagu-futomu'),
(1389, '', '<p>Egyedi Volkswagen Golf 7 V-Maxx állítható magasságú sport futómű</p>\n<p>Ez a jármű 2012 októberétől kapható</p>\n<p>Csupán Multilink futóművel szerelve</p>\n<p>Az első tengely terhelése 965kg alatt</p>\n<p>A hátsó tengely terhelése 1070kg alatt</p>\n<p>A futómű TÜV engedéllyel rendelkezik!</p>\n<p>Az ültetés mértéke az első részen 30-65mm</p>\n<p>Az ültetés mértéke a hátsó részen 45-65mm</p>', 'V-Maxx Volkswagen Golf 7, csak Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 965kg alatt), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-csak-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-965kg-alatt-55mm-szaratmer-allithato-magassagu-futomu'),
(1390, '', '<strong>V-Maxx állítható magasságú sport futómű Volkswagen Golf 7-hez</strong></p>  <p>Ez a futómű kompatibilis a 2012.10-től gyártott Volkswagen Golf 7 modellekkel, kivéve azokat, amelyek Multilink futóművel rendelkeznek.</p>  <p>Az első tengely maximális terhelése 966-1010kg között van, míg a hátsó tengelyen 980kg alatt kell hogy legyen.</p>  <p>Ez a futómű TÜV engedéllyel rendelkezik, így biztos lehet benne, hogy megfelel az összes szabványnak.</p>  <p>Az ültetés mértéke elöl 30-65mm között, míg hátul 45-65mm között állítható.</p>  ', 'V-Maxx Volkswagen Golf 7, kivéve Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 966-1010kg), 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-kiveve-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-966-1010kg-50mm-szaratmer-allithato-magassagu-futomu'),
(1391, '', '<strong>V-Maxx állítható magasságú sport futómű a Volkswagen Golf 7-hez</strong></p>  <p>Az autó évjárata 2012. októbere után lehet</p>  <p>A futómű Multilink kivételével minden változatban elérhető</p>  <p>Az első tengely terhelése: 966-1010kg között van</p>  <p>A hátsó tengely terhelése: 980kg alatt van</p>  <p>A futómű rendelkezik TÜV engedéllyel</p>  <p>Az ültetés mértéke elöl: 30-65mm</p>  <p>Az ültetés mértéke hátul: 45-65mm</p> ', 'V-Maxx Volkswagen Golf 7, kivéve Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 966-1010kg), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-kiveve-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-966-1010kg-55mm-szaratmer-allithato-magassagu-futomu'),
(1392, '', '<p>A Volkswagen Golf 7 V-Maxx sport futóművének állítható magassága lehetővé teszi az optimális vezetési élményt. Ez a modell 2012 októbere után került forgalomba. Kizárólag Multilink futóművel rendelkezik, ami garantálja a stabil és dinamikus vezethetőséget. Az első tengely terhelése 966-1010 kg között van, míg a hátsó tengely terhelése 1070 kg alatt van. Fontos megjegyezni, hogy rendelkezik TÜV engedéllyel, így biztos lehet benne, hogy az autó megfelel az előírásoknak. Az ültetés mértéke elöl 30-65 mm, míg hátul 45-65 mm lehet.</p> ', 'V-Maxx Volkswagen Golf 7, csak Multilink futóművel szerelt, 2012.10-től, (első tengely terhelés: 966-1010kg), 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-golf-7-csak-multilink-futomuvel-szerelt-2012-10-tol-els-tengely-terheles-966-1010kg-55mm-szaratmer-allithato-magassagu-futomu'),
(1393, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be a kívánt ülésmagasságot. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját kínáljuk, maximalizálva ezzel az ülésmagasságot.</span></div>  <div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmóniáját garantálva optimális felépítést érhetünk el.</div>  <ul> 	<li>kiváló minőség megfizethető áron</li> 	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li> 	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>egyedülálló ár/érték arány</li> 	<li>Német minőség</li> </ul>', 'AP made by KW Volkswagen Golf 7 GTi, R, 2013.05-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-golf-7-gti-r-2013-05-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1394, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN GOLF 7</p>  <ul> 	<li><strong>Évjárat</strong>: 2013-tól</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VII, Typ AUV, Variant, 2WD, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 50 mm, az első tengely terhelése maximum 965 kg</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (maximum) 965 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li> 	<li><strong>Engedély</strong>:</li> </ul>  <p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt. A beállítható ültetés lehetőséget ad az egyéni preferenciák szerinti testreszabásra. A futómű szett kizárólag kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet kínálnak.</p>  <p>A termék TÜV minősítéssel rendelkezik. A gyártó, aki több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintező vagy torziós futóművet szereltek.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968757</p>', 'Vogtland Volkswagen Golf 7 Variant, kivéve Multilink és DDC futóművel, 2013.07-től, 50mm szárátmérő, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-kiveve-multilink-es-ddc-futomuvel-2013-07-tol-50mm-szaratmer-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(1395, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a 2013-tól gyártott Volkswagen Golf VII modellekhez. Ez a minőségi futómű rendszer lehetőséget biztosít az autó megjelenésének javítására, miközben optimális vezetési élményt nyújt. A futómű beállítását saját igényei szerint variálhatja. Ez a speciális kétcsöves lengéscsillapítókat tartalmazó szett alacsony nyomású gázrendszerrel rendelkezik, amely kiegyensúlyozott komfortot és fokozott dinamikát biztosít. A lengéscsillapítók korrózióvédelemmel rendelkeznek. </p> \n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve. </p> \n<p>A termék Made in Germany! </p> \n<p>Cikkszám: 968758</p>', 'Vogtland Volkswagen Golf 7 Variant, kivéve Multilink és DDC futóművel, 2013.07-től, 50mm szárátmérő, (első tengely terhelés 966-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-kiveve-multilink-es-ddc-futomuvel-2013-07-tol-50mm-szaratmer-els-tengely-terheles-966-1090kg-allithato-magassagu-futomu'),
(1396, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a 2013-tól gyártott VOLKSWAGEN GOLF 7 modellhez. Ez a kiváló minőségű futómű rendszer lehetővé teszi az autó megjelenésének javítását és a maximális vezetési élmény biztosítását. A futómű beállításával személyre szabhatja az ültetés mértékét a saját igényei szerint.\n\nEz a speciálisan tervezett futómű szett kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus vezetést biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, így hosszú távon is optimális teljesítményt biztosítanak.\n\nA termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyekhez szintezős vagy torziós futóművet használnak.\n\nNe feledje, ez a termék Made in Germany! Cikkszám: 968842</p>', 'Vogtland Volkswagen Golf 7 Variant, kivéve Multilink és DDC futóművel, 2013.07-től, 55mm szárátmérő, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-kiveve-multilink-es-ddc-futomuvel-2013-07-tol-55mm-szaratmer-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1397, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN GOLF 7</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2013-tól</li>\n	<li><strong>Ültetés mértéke:</strong> 35 - 65 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Golf VII, Typ AUV, Variant, 2WD, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 50 mm, az első tengely terhelése legfeljebb 965 kg</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 965 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni elképzelések szerint állíthatja be a megfelelő értékek között. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott komfortérzetet és a fokozott dinamikát. A lengéscsillapítók rendkívül ellenállóak a korróziónak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező- vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968766</p>', 'Vogtland Volkswagen Golf 7 Variant, csak Multilink futóművel, kivéve DDC, 2013.07-től, 50mm szárátmérő, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-csak-multilink-futomuvel-kiveve-ddc-2013-07-tol-50mm-szaratmer-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(1398, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett ideális választás lehet a 2013-tól gyártott Volkswagen Golf VII modellekhez. Ez a futómű kitűnően javíthatja az autó megjelenését és biztosíthatja a maximális vezetési élményt. A futómű beállítását az egyéni igények szerint lehet módosítani, a megfelelő értékeken belül.</p>\n<p>A futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú, így hosszú távon is megfelelő teljesítményt nyújtanak.</p>\n<p>A futómű TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel rendelkeznek.</p>\n<p>Az termék Made in Germany minőséget képvisel, és cikkszáma: 968767.</p>', 'Vogtland Volkswagen Golf 7 Variant, csak Multilink futóművel, kivéve DDC, 2013.07-től, 50mm szárátmérő, (első tengely terhelés 966-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-csak-multilink-futomuvel-kiveve-ddc-2013-07-tol-50mm-szaratmer-els-tengely-terheles-966-1090kg-allithato-magassagu-futomu'),
(1399, '', '<strong>Vogtland</strong> állítható magasságú futómű szett a Volkswagen Golf 7-hez</p>  <ul> 	<li><strong>Évjárat</strong>: 2013-tól</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VII, Typ AUV, Variant, 2WD, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése maximum 965 kg</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (maximum) 965 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt biztosít. Az ültetés mértékét szabadon állíthatja az egyéni igények szerint. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a tartóssághoz.</p>  <p>A termék TÜV minősítéssel rendelkezik. A gyártó cég, amely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p>  <p>Németországban készült!</p>  <p>Cikkszám: 968768</p> ', 'Vogtland Volkswagen Golf 7 Variant, csak Multilink futóművel, kivéve DDC, 2013.07-től, 55mm szárátmérő, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-csak-multilink-futomuvel-kiveve-ddc-2013-07-tol-55mm-szaratmer-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(1400, '', '<p>A Vogtland állítható magasságú futómű szett kifejezetten a Volkswagen Golf VII típushoz lett tervezve, az évektől 2012-től. Az ültetés mértéke 35-65 mm között állítható, és a max. tengelyterhelés elöl 1080 kg, míg hátul 980 kg. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű két csöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerének köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. A lengéscsillapítók kiváló korrózió elleni védelemmel rendelkeznek.</p><p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugó gyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél más típusú futóművet alkalmaznak.</p><p>A termék Made in Germany és a cikkszám: 968841.</p>', 'Vogtland Volkswagen Golf 7, kivéve Multilink és DDC futóművel, 2012.11-től, 55mm szárátmérő, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-kiveve-multilink-es-ddc-futomuvel-2012-11-tol-55mm-szaratmer-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1401, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: Volkswagen Golf 7</p>  <ul> 	<li><strong>Évjárat</strong>: 2013-tól</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VII, Typ AUV, Variant, 2WD, csak multi-link hátsó felfüggesztéshez, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése több mint 965 kg</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1090 kg (több mint 965 kg)</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1050 kg</li> </ul>  <p>A Vogtland állítható futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is biztosít. Az ültetés mértékét saját igényeinek megfelelően állíthatja be. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme első osztályú.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>  <p>A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968770</p>', 'Vogtland Volkswagen Golf 7 Variant, csak Multilink futóművel, kivéve DDC, 2013.07-től, 55mm szárátmérő, (első tengely terhelés 966-1090kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-variant-csak-multilink-futomuvel-kiveve-ddc-2013-07-tol-55mm-szaratmer-els-tengely-terheles-966-1090kg-allithato-magassagu-futomu'),
(1402, '', '<div> <div> <p><strong>Vogtland</strong> által állítható magasságú futómű szett: VOLKSWAGEN GOLF 7</p>  <ul> 	<li><strong>Évjárat</strong>: 2013-tól</li> 	<li><strong>Ültetés mértéke:</strong> 25 - 55 / 20 - 45 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VII, R, GTI, GTD, kivéve DDC futóművel szerelt</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1080 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 980 kg</li> 	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF0G-H-N_1116-14.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW800GF0G-H-N_1116-14.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett kivételes vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. A kitűnő minőségű futómű csak kiváló teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és fokozott dinamizmust biztosítanak. A lengéscsillapítók első osztályú korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint egy évszázados tapasztalattal rendelkezik a rugókészítés területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968740</p> </div> </div>', 'Vogtland Volkswagen Golf 7 R, GTi, GTD, kivéve DCC-vel szerelt típusok, 2013.05-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-r-gti-gtd-kiveve-dcc-vel-szerelt-tipusok-2013-05-tol-allithato-magassagu-futomu'),
(1403, '', '<strong>Vogtland</strong> állítható magasságú futómû szett: VOLKSWAGEN GOLF 7</p>  <ul> 	<li><strong>Évjárat</strong>: 2013-tól</li> 	<li><strong>Ültetés mértéke:</strong> 10 - 40 / 10 - 35 mm</li> 	<li><strong>Típus</strong>: Volkswagen Golf VII R Variant, kivéve DDC futómûvel szerelt</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1100 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1100 kg</li> 	<li><strong>Engedély</strong>:</li> </ul>  <p>Az autó megjelenésének javítása mellett a futómû szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igényeknek megfelelõen állíthatja be. Ez a kiváló minõségû futómû szett kizárólag speciális, nagy teljesítményû két csöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetõen. Az elsõ osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minõsítéssel. A gyártó cég, amely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetõ rugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetõen 4 db ültetõ rugóból és 4 db lengéscsillapítóból áll, kivéve azokat az autótípusokat, amelyek szintezõs vagy torziós futómûvel vannak felszerelve.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968843</p>  ', 'Vogtland Volkswagen Golf 7 R Variant, kivéve DDC futóművel, 2013.05-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-r-variant-kiveve-ddc-futomuvel-2013-05-tol-allithato-magassagu-futomu'),
(1404, '', '<p>A Vogtland által készített állítható magasságú futómű szett megfelel a 2012-től gyártott Volkswagen Golf VII típusú autókhoz. Az ültetés mértéke 35-65 mm, és csak a 2WD, 2.0 TDI motorral rendelkező modellekhez használható. A futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek kiegyensúlyozott komfortot és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelme első osztályú.</p> \n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>\n\n<p>Ne felejtsd, hogy ez a termék Made in Germany!</p>\n\n<p>Cikkszám: 968737</p>', 'Vogtland Volkswagen Golf 7, csak Multilink futóművel, kivéve DDC, 2012.11-től, 50mm szárátmérő, (első tengely terhelés 966-1080kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-csak-multilink-futomuvel-kiveve-ddc-2012-11-tol-50mm-szaratmer-els-tengely-terheles-966-1080kg-allithato-magassagu-futomu'),
(1405, '', '<p>A Vogtland által készített állítható magasságú futómű szett ideális választás a 2012-től gyártott Volkswagen Golf VII modellekhez. Ez a speciális futómű kifejezetten a Golf VII típusokhoz lett tervezve, és csak a multi-link hátsó felfüggesztéssel rendelkező modellekhez ajánlott. A futómű beállítható ültetési mértéke 35-65 mm között, ami lehetővé teszi a személyre szabott beállítást. </p>\n\n<p>A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítva a kiegyensúlyozott komfortot és dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, és garantálják a maximális vezetési élményt. A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. </p>\n\n<p>A futómű maximális tengelyterhelése elöl 965 kg, míg hátul 980 kg. A csomag tartalmazza az ültetőrugókat és lengéscsillapítókat, kivéve azoknál az autóknál, melyek szintezővel vagy torziós futóművel vannak felszerelve. </p>\n\n<p>A Vogtland futóművei Németországban készülnek, és a legmagasabb minőséget képviselik. A cikkszám: 968735.</p>', 'Vogtland Volkswagen Golf 7, csak Multilink futóművel, kivéve DDC, 2012.11-től, 50mm szárátmérő, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-csak-multilink-futomuvel-kiveve-ddc-2012-11-tol-50mm-szaratmer-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu'),
(1406, '', '<p><strong>Vogtland</strong> által készített állítható magasságú futómű szett a <strong>VOLKSWAGEN GOLF 7</strong> modellekre. Ez a futómű szett passzol az alábbi típusokhoz: Volkswagen Golf VII, Typ AU, 2WD, 1.2 TSI 63 kW, 1.2 TSI 77 kW, 1.4 TGI, 1.6 TDI BlueMotion 81 kW, amelyek csak torziós hátsó felfüggesztéssel rendelkeznek. Az ültetés mértéke állítható 35-65 / 35-65 mm között. A lengéscsillapító ház átmérője 50 mm.</p>\n<p><strong>Fontos adatok:</strong></p>\n<ul>\n	<li><strong>Évjárat</strong>: 2012-től</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 965 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 980 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF27-28_1115-14.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW810GF27-28_1115-14.pdf</a></li>\n</ul>\n<p>A Vogtland futómű nemcsak javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. A speciális, nagy teljesítményű kétcsöves lengéscsillapítóknak köszönhetően kiegyensúlyozott komfort és fokozott dinamika érhető el. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra, akik már több mint 100 éves tapasztalattal rendelkeznek a rugógyártás terén.</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak szerelve.</p>\n<p>Made in Germany!</p>\n<p><strong>Cikkszám:</strong> 968743</p>', 'Vogtland Volkswagen Golf 7, kivéve Multilink és DDC futóművel, 2012.11-től, 50mm szárátmérő, (első tengely terhelés 965kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-kiveve-multilink-es-ddc-futomuvel-2012-11-tol-50mm-szaratmer-els-tengely-terheles-965kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1407, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kifejezetten a 2012-től gyártott Volkswagen Golf VII típushoz lett tervezve. Az ültetés mértéke 35-65 mm lehet, mind elöl, mind hátul. Ez a speciális futómű szett kizárólag a Golf VII típusú járművekhez alkalmas, melyek multi-link hátsó felfüggesztéssel rendelkeznek, a lengéscsillapító ház átmérője pedig 55 mm.</p>\n\n<p>Ez a futómű nem csupán esztétikailag javítja az autó megjelenését, hanem a maximális vezetési élményt is garantálja. A beállítások segítségével az ültetés mértékét személyre szabhatja az egyéni igényei szerint. A kiváló minőségű futómű szett tartalmazza a nagy teljesítményű két csöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, így kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú élettartamúak.</p>\n\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintező vagy torziós futóművet alkalmaznak.</p>\n\n<p>Az termék Made in Germany minősítéssel büszkélkedhet, és cikkszáma: 968739.</p>', 'Vogtland Volkswagen Golf 7, csak Multilink futóművel, kivéve DDC, 2012.11-től, 55mm szárátmérő, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-csak-multilink-futomuvel-kiveve-ddc-2012-11-tol-55mm-szaratmer-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1408, '', '<p><strong>Vogtland</strong> állítható magasságú futómû szett a VOLKSWAGEN GOLF 7-hez</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2012-tõl</li>\n	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Golf VII, Typ AU, 2WD, 1.6 TDI 77 kW, 1.6 BlueTDI 81 kW, csak torziós hátsó felfüggesztéshez, a lengéscsillapító ház átmérõ 50 mm</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 1060 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 980 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW810GF27-28_1115-14.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW810GF27-28_1115-14.pdf</a></li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett optimális vezetési élményt biztosít. Az ültetés mértékét személyes igényei szerint állíthatja be. Ez a minőségi futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968746</p>', 'Vogtland Volkswagen Golf 7, kivéve Multilink és DDC futóművel, 2012.11-től, 50mm szárátmérő, (első tengely terhelés 966-1060kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-golf-7-kiveve-multilink-es-ddc-futomuvel-2012-11-tol-50mm-szaratmer-els-tengely-terheles-966-1060kg-allithato-magassagu-futomu'),
(1409, '', '<div><strong><span>Volkswagen Golf 7 Bilstein B14 állítható magasságú sport futómű</span></strong><br /> <br /> <span>A BILSTEIN B14 sport futómű egyedülálló egycsöves rendszerrel rendelkezik</span><br /> <span>Megbízható Upside-Down technológiával</span><br /> <span>Kiváló minőségű versenysportrugók felhasználásával</span><br /> <span>A futómű állítható magasságot biztosít, alumíniumból készült rugótányér és kontra anya segítségével</span><br /> <span>A BILSTEIN B14 sport futóművet az utcára tervezett versenysport technológia jellemzi. A B14 PSS lehetővé teszi a jármű magasságának csökkentését akár 50 mm-rel az első és hátsó tengelyen belül, egy 20 mm-es állítási tartományon belül. Az egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</span></div>', 'Bilstein Volkswagen Golf 7, 2013.05-től, kivéve Multilink futóművel szerelt, 50mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-7-2013-05-tol-kiveve-multilink-futomuvel-szerelt-50mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1410, '', '<div><strong><span>Volkswagen Golf 7 Bilstein B14 sport futómű állítható magassággal</span></strong><br/><br/><span>A Bilstein által kifejlesztett egycsöves rendszer</span><br/><span>Megfordított technológiával</span><br/><span>Versenysportrugók kiváló minőségű anyagból</span><br/><span>Állítható magasságú futómű (alumínium rugótányér és kontra anya)</span><br/><span>A B14 PSS futóművet tervező Bilstein mérnökei az utcára szánt versenysport technológiát valósították meg, ami számos előnnyel jár. A B14 PSS lehetővé teszi a jármű magasságának akár 50 mm-rel való csökkentését az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű, egycsöves Upside-Down technológiával a B14 PSS futómű biztosítja a kiegyensúlyozott menetteljesítményt és a vezetési élményt minden körülmények között.</span></div>', 'Bilstein Volkswagen Golf 7, 2013.05-től, csak Multilink futóművel szerelt, 50mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-7-2013-05-tol-csak-multilink-futomuvel-szerelt-50mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1411, '', '<strong>Volkswagen Golf 8 JOM Blueline állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Golf 8, 2019.07-től</strong></li>\\r\\n	<li><strong>Kivéve Multilink futóművel szerelt típusokhoz</strong></li>\\r\\n	<li>Első tengely terhelés: 1035 kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 980 kg alatt</li>\\r\\n	<li>Fontos tudnivaló: Az optimális beszerelés érdekében javasolt egy állítható hosszúságú stabilizátor szett (kutyacsont) vásárlása, mely nem része ennek a futóműszettnek!</li>\\r\\n	<li>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-55mm, hátul: 30-55mm között szabályozható<br />\\r\\n	(A gyakorlatban a futómű nagyobb intervallumban is állítható, azonban a TÜV engedély csak a fenti beállításokkal érvényes.)</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Készült JOM gyártásában Németországban</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszáma: </strong>741233</p>\\r\\n\\r\\n<p>A JOM Blueline Állítható magasságú futóműszett prémium minőségű, autó-specifikus alkatrészekből áll össze.</p>\\r\\n\\r\\n<p>A magasság beállítása testre szabható az egyéni igények szerint az előzőleg említett paraméterek között.</p>\\r\\n\\r\\n<p>A rugók keménysége és a csillapítás mértéke egyenletes marad az összes beállítási lehetőség során.</p>\\r\\n\\r\\n<p>Kiemelkedően nagy kanyarstabilitást nyújt, mivel ellenáll a keresztirányú erőknek rendkívül hatékonyan.</p>\\r\\n', 'Jom Bochum Volkswagen Golf 8, kivéve Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-8-kiveve-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1412, '', '<p>Egyedi JOM Blueline állítható magasságú sport futómű Volkswagen Golf 8-hoz.</p>\n\n<ul>\n	<li>Volkswagen Golf 8 modell, gyártva 2019.07-től</li>\n	<li>Nem kompatibilis Multilink futóművel szerelt típusokkal</li>\n	<li>Első tengely terhelés: 1036-1100 kg</li>\n	<li>Hátsó tengely terhelés: kevesebb, mint 980 kg</li>\n	<li>Fontos! Ajánlott beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont), mely nem tartozék</li>\n	<li>Német nyelvű TÜV engedéllyel rendelkezik</li>\n	<li>Az engedélyben előírt ültetési mérték elöl: 20-55mm, hátul: 30-55mm között állítható (bár általában szélesebb beállítási tartományban működik, a TÜV csak ezeket a beállításokat engedélyezi)</li>\n</ul>\n\n<ul>\n	<li>Gyártva JOM Németországban</li>\n</ul>\n\n<p><strong>Cikkszám: </strong>741237</p>\n\n<p>A JOM Blueline állítható magasságú futóműszett prémium minőségű, autó-specifikus alkatrészekből áll.</p>\n\n<p>A magasság beállítása testreszabható az egyéni igények szerint a fent említett paraméterek között.</p>\n\n<p>A rugó keménysége és a csillapítás mértéke az egész beállítási tartományban egyenletes.</p>\n\n<p>Kiemelkedő kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>', 'Jom Bochum Volkswagen Golf 8, kivéve Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 1036-1100kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-8-kiveve-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-1036-1100kg-allithato-magassagu-futomu'),
(1413, '', '<p>Az állítható magasságú JOM Blueline futómű megfelel a Volkswagen Golf 8 típusokhoz, melyek Multilink futóművel vannak ellátva, és 2019.07-től kaphatók. Ennek az autónak az első tengelyénél a terhelés 1035 kg alatt van, míg a hátsó tengelyénél ez az érték 980 kg alatt található.</p>\n\n<p>Fontos megjegyzés, hogy a futómű beszereléséhez ajánlott egy állítható hosszúságú stabilizátor szett (kutyacsont), azonban ezt a szettet nem tartalmazza a termékcsomag.</p>\n\n<p>Ez a futóműszett rendelkezik német nyelvű TÜV engedéllyel, melyben meghatározott, hogy az ültetés mértéke elöl 20-55 mm, míg hátul 30-55 mm között állítható. Fontos tudni, hogy bár általában nagyobb intervallumban is be lehet állítani a futóművet, a TÜV engedély csak a fent említett beállításokat fogadja el.</p>\n\n<ul>\n    <li>Made In JOM Németország</li>\n</ul>\n\n<p><strong>Cikkszáma: </strong>741241</p>\n\n<p>A JOM Blueline állítható magasságú futóműszett kiváló minőségű autó-specifikus alkatrészekből áll. A magasság beállítása egyénileg, az egyéni igények szerint történik a fent említett paraméterek között. A futómű teljes beállítási tartományában a rugó keménysége és a csillapítás mértéke egyenlő. Emellett kivételesen nagy kanyarstabilitást biztosít, ellenállva a keresztirányú erőknek.</p>', 'Jom Bochum Volkswagen Golf 8, csak Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-8-csak-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1414, '', '<p><strong>Volkswagen Golf 8 JOM Blueline futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Golf 8, 2019.07-től</strong></li>\\r\\n	<li><strong>Csak Multilink futóművel felszerelt változatokhoz</strong></li>\\r\\n	<li>Első tengely maximális terhelése: 1036-1100 kg</li>\\r\\n	<li>Hátsó tengely maximális terhelése: 980 kg alatt</li>\\r\\n	<li>Fontos! Az állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott a beszereléshez, de nem tartalmazza a szett!</li>\\r\\n	<li>A futóműszett rendelkezik német nyelvű TÜV engedéllyel!</li>\\r\\n	<li>Az engedély által meghatározott ültetési lehetőségek: elöl 20-55mm, hátul 30-55mm között állítható<br />\\r\\n	(A futómű szinte minden esetben ennél nagyobb intervallumban állítható, de a TÜV engedély csak a fenti beállításokra vonatkozik.)</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Gyártva JOM Németország által</li>\\r\\n</ul>\\r\\n\\r\\n<p><strong>Cikkszám: </strong>741245</p>\\r\\n\\r\\n<p>A JOM Blueline állítható magasságú futóműszett kiváló minőségű autó-specifikus alkatrészekből áll össze.</p>\\r\\n\\r\\n<p>A magasságbeállítás személyre szabható az előzőleg említett paraméterek között.</p>\\r\\n\\r\\n<p>A rugó keménysége és a csillapítás mértéke az egész beállítási tartományban azonos.</p>\\r\\n\\r\\n<p>Kiemelkedően nagy kanyarstabilitást biztosít, mivel nagyon ellenáll a keresztirányú erőknek.</p>', 'Jom Bochum Volkswagen Golf 8, csak Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 1036-1100kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-golf-8-csak-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-1036-1100kg-allithato-magassagu-futomu'),
(1415, '', '<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az versenyképes ár. Az útviszonyoknak megfelelően fokozatmentesen állítható a jármű hasmagassága, így biztosítva a maximális komfortot és teljesítményt. Az MTS-Technik futóművei kiemelkedő összhangot biztosítanak a rugók és a lengéscsillapítók között.</p><p><u>Termékjellemzők:</u></p><ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>A termék rendelkezik TÜV engedéllyel</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém igénybevételek mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Az összhang tökéletes a rugók és a lengéscsillapítók között</li> 	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li></ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 8, kivéve Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-8-kiveve-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(1416, '', '<p>A MTS-Technik által kifejlesztett sport futóművek ideális választást jelentenek azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. Az állítható magasságú futóművek lehetővé teszik a hasmagasság könnyed beállítását az útviszonyoknak megfelelően, fokozatmentesen. Az MTS-Technik futóművei a rugók és lengéscsillapítók optimális egyensúlyát biztosítják.</p> <p><u>Termékjellemzők:</u></p> <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>TÜV engedéllyel rendelkeznek</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók biztosítják a magas hatékonyságot extrém körülmények között is</li> 	<li>Két rétegű bevonattal rendelkeznek a hosszan tartó korrózióvédelem érdekében</li> 	<li>A futóművek tökéletes összhangot biztosítanak a rugók és lengéscsillapítók között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  ', 'MTS-Technik by Nord Performance Volkswagen Golf 8, kivéve Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-8-kiveve-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(1417, '', '<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. Az útviszonyoknak megfelelően könnyedén beállítható a jármű hasmagassága, mivel fokozatmentesen állítható magassággal rendelkeznek. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach vállalat gyártja.</li>\n	<li>A termék rendelkezik TÜV engedéllyel.</li>\n	<li>A magasság szabadon változtatható általában 25 és 80 mm között.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém terhelés esetén is.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 8, csak Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 981-1140kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-8-csak-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-981-1140kg-street-series-allithato-magassagu-futomu'),
(1418, '', '<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást jelentenek azok számára, akik számára fontos a kiváló minőség és megfizethető ár. A futóművek magassága folyamatosan szabályozható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. A MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az Eibach nevű gyártó készíti</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság széles skálán, általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózió ellen (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangban vannak</li>\n	<li>A készlet plug & play, nincs szükség módosításokra az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Golf 8, csak Multilink futóművel szerelt, 2019.07-től, (első tengely terhelés 980kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-golf-8-csak-multilink-futomuvel-szerelt-2019-07-tol-els-tengely-terheles-980kg-alatt-street-series-allithato-magassagu-futomu'),
(1419, '', '<p><strong>Volkswagen Passat B8 Bilstein B14 futómű állítható magassággal</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat B8</strong> különböző motorváltozatai, beleértve a hibrid modellt is</li>\\r\\n	<li><strong>Volkswagen Passat B8 Variant</strong> különböző motorváltozatai</li>\\r\\n	<li>Nem kompatibilis a DCC futóművel</li>\\r\\n	<li>Csak Multilink futóművel kompatibilis</li>\\r\\n	<li>55mm szárátmérő</li>\\r\\n	<li>Első tengely terhelés: 1200kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 1253kg alatt</li>\\r\\n</ul>\\r\\n\\r\\n<p><br />\\r\\nBILSTEIN egycsöves rendszer<br />\\r\\nSpeciális Upside-Down technológia<br />\\r\\nVersenysportrugók magas szilárdságú anyagból készültek<br />\\r\\nLehetőség van az állítható magasságra alumíniumból készült rugótányér és kontra anya segítségével<br />\\r\\nA B14 futómű ezt a versenysport technológiát hozza az utcára, lehetővé téve a jármű magasságának csökkentését akár 50mm-rel az első és hátsó tengelynél, egy 20mm-es állítási tartományon belül. Az extrém terhelésre tervezett egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és vezetési élményt a B14 PSS-sel.</p>\\r\\n', 'Bilstein Volkswagen Golf 8, beleértve Variant, csak Multilink futóművel szerelt, 2019.07-től, 55mm szárátmérő, (első tengely terhelés 1200kg alatt), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-8-beleertve-variant-csak-multilink-futomuvel-szerelt-2019-07-tol-55mm-szaratmer-els-tengely-terheles-1200kg-alatt-bilstein-b14-allithato-magassagu-futomu'),
(1420, '', '<strong>Bilstein B14 állítható magasságú futómű a Volkswagen Golf 8-hoz</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Golf 8, </strong>1.0TSi, 1.5TSi, 2.0GTi, 2.0GTi Clubsport, 2.0TDi, 2.0TDi GTD</li>\\r\\n	<li><strong>Volkswagen Golf 8 Variant, </strong>1.0TSi, 1.5TSi, 2.0TSi 4-Motion, 2.0TDi, 2.0TDi 4-Motion</li>\\r\\n	<li>Kivéve DCC futóművel szerelt</li>\\r\\n	<li>Csak Multilink futóművel</li>\\r\\n	<li>50mm szárátmérő</li>\\r\\n	<li>Első tengely terhelés: 1200kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 1253kg alatt</li>\\r\\n</ul>\\r\\n\\r\\n<p><br />\\r\\nBilstein egycsöves rendszer<br />\\r\\nTetején-levéve technológiával<br />\\r\\nVersenysport rugók magas szilárdságú anyagból<br />\\r\\nÁllítható magasság (a rugótányér és a kontra anya alumíniumból készül)<br />\\r\\nVersenysport technológia az utcára, a B14-gyel a Bilstein mérnökei ezt az elképzelést valósították meg, ami óriási előnyt jelent. A B14 PSS-nél a jármű magassága, az első és hátsó tengelynél max. 50 mm-rel csökkenthető, egy behatárolt 20mm-es állítási tartományon belül. A B14 PSS extrémen terhelhető egycsöves Tetején-levéve technológiája gondoskodik minden szituációban a kiegyensúlyozott menetteljesítményről és a vezetés öröméről.</p>\\r\\n', 'Bilstein Volkswagen Golf 8, beleértve Variant, csak Multilink futóművel szerelt, 2019.07-től, 50mm szárátmérő, (első tengely terhelés 1200kg alatt), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-golf-8-beleertve-variant-csak-multilink-futomuvel-szerelt-2019-07-tol-50mm-szaratmer-els-tengely-terheles-1200kg-alatt-bilstein-b14-allithato-magassagu-futomu'),
(1421, '', '<p>Egy olyan Volkswagen Golf 1 JOM BLUE LINE sport futómű, melynek magassága állítható, rendelkezésre áll.</p>\\r\\n\\r\\n<p>Ez a futómű egy olyan időszakban készült, mely 1974.04 és 1993 között volt aktuális.</p>\\r\\n\\r\\n<p>Az adott típus 17/155-ös jelzéssel bír, beleértve a Cabrio modellt is.</p>\\r\\n\\r\\n<p>Az első tengelyterhelés 785 kg, míg a hátsó tengelyterhelés 640 kg.</p>\\r\\n\\r\\n<p>Ez a termék MADE IN GERMANY, tehát Németországban készült.</p>\\r\\n\\r\\n<p>Az említett futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>Az ajánlat 2 ÉV TELJESKÖRŰ GARANCIÁVAL érhető el.</p>\\r\\n\\r\\n<p>Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs felhasználásával.</p>\\r\\n\\r\\n<p>A futómű kiváló minőségű és rendkívül versenyképes áron kapható.</p>\\r\\n\\r\\n<p>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot az állításhoz.</p>', 'Jom Bochum  Volkswagen Jetta 1, 1974-1984-ig, BlueLine állítható magasságú futómű', '', '', '', 'jom-bochum--volkswagen-jetta-1-1974-1984-ig-blueline-allithato-magassagu-futomu'),
(1422, '', '<strong>Volkswagen Golf 1 MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik nagy hangsúlyt fektetnek a kiváló minőségre és az elérhető árra! A magasság fokozatmentesen szabályozható, így könnyedén alkalmazkodhat az útviszonyokhoz, és beállíthatja az autó hasmagasságát! Az MTS-Technik állítható futóműveiben optimális egyensúly van a rugók és a lengéscsillapítók között.</p>  <p><u>Az alábbi típusokhoz illik:</u></p>  <ul> 	<li><strong>Volkswagen Golf 1, </strong>1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> 	<li><strong>Volkswagen Golf 1 Cabrio,</strong> 1.5 / 1.6 / 1.8</li> 	<li>az ülésmagasság elülső részén: 35-80mm</li> 	<li>az ülésmagasság hátsó részén: 35-80mm</li> 	<li>az első tengely terhelése: 785kg</li> 	<li>a hátsó tengely terhelése: 640kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a rugókat az <strong>Eibach</strong> gyártja</li> 	<li>a magasság széles határok között szabadon állítható általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiváló hatékonyság extrém terhelés esetén is</li> 	<li>két rétegű bevonat a hosszú távú korrozív hatások ellen (sárga cinkbevonat és fekete anodizált alumínium alkatrészek)</li> 	<li>ideális összhang a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék jellemzői:</u></p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  <p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance  Volkswagen Jetta 1, 1974-1984-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance--volkswagen-jetta-1-1974-1984-ig-street-series-allithato-magassagu-futomu'),
(1423, '', '<p>Az MTS-Technik Comfort sorozatú állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a sportos megjelenés mellett az utazási kényelem. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik Comfort futóművei tökéletes egyensúlyban vannak az Eibach rugókkal és MTS-Technik lengéscsillapítókkal.</p>\n\n<u>A következő típusokhoz illeszkedik:</u>\n<ul>\n	<li>Volkswagen Golf 1, 1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li>\n	<li>Volkswagen Golf 1 Cabrio, 1.5 / 1.6 / 1.8</li>\n	<li>Ültetés mértéke elöl: 35-80mm</li>\n	<li>Ültetés mértéke hátul: 35-80mm</li>\n	<li>Első tengely terhelés: 785kg</li>\n	<li>Hátsó tengely terhelés: 640kg</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók a maximális kényelem érdekében</li>\n	<li>A Comfort sorozat készítésekor a hangsúly a magas kényelemre helyeződött</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszútávú korrózióvédelem érdekében</li>\n	<li>Tökéletes egyensúly a rugók és lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást a jármű felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék karakterisztika:</strong></u>\n<em>A weboldal szöveges tartalmának, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\n<p><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></p>', 'MTS-Technik by Nord Performance  Volkswagen Jetta 1, 1974-1984-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance--volkswagen-jetta-1-1974-1984-ig-comfort-series-allithato-magassagu-futomu'),
(1424, '', '<strong>Volkswagen Golf 1 MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>  <p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futóművei tökéletes választás azoknak, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimalizáltak az <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong>. A széles ültetési tartomány és a maximális vezetési élmény garantált.</p>  <p><u>A következő típusokhoz illeszkedik:</u></p>  <ul> 	<li><strong>Volkswagen Golf 1, </strong>1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> 	<li><strong>Volkswagen Golf 1 Cabrio,</strong> 1.5 / 1.6 / 1.8</li> 	<li>ültetés mértéke elöl: 35-80mm</li> 	<li>ültetés mértéke hátul: 35-80mm</li> 	<li>első tengely terhelés: 785kg</li> 	<li>hátsó tengely terhelés: 640kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>speciális <strong>Eibach rugókkal</strong> maximalizálható a sportosság</li> 	<li>a <strong>Sport Series</strong> létrehozásakor a szélesebb ültetési tartomány mellett a fokozott vezetési élmény volt a cél</li> 	<li>gáztöltéses lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugók és lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzők:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Volkswagen Jetta 1, 1974-1984-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-jetta-1-1974-1984-ig-sport-series-allithato-magassagu-futomu'),
(1425, '', '<div> <p>Ez a AP-Fahrwerke Állítható magasságú futómû alkalmas a következõ autótípusra:</p>  <ul> 	<li>VW Jetta 1, beleértve a Cabrio változatot is</li> 	<li>Tipuskód: 17,155</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1974.04 - 1993.08</li> 	<li>Tengelyterhelés elöl (kg): 785</li> 	<li>Tengelyterhelés hátul (kg): 640</li> 	<li>Egyéb kitételek: -</li> </ul>  <ul> 	<li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-70 mm, hátul: 40-70 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetõség elöl: +40 mm, hátul: +40 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>Garancia idõtartama erre a termékre: 2 év</li> </ul>  <p><strong>Cikkszáma: GF80-001</strong></p>  <p><br /> Az ár 1 szettre érvényes!</p> </div>  ', 'AP made by KW  Volkswagen Jetta 1, 1974-1984-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw--volkswagen-jetta-1-1974-1984-ig-allithato-magassagu-futomu'),
(1426, '', '<br /><div><br /><p><em>A Volkswagen Jetta 1 V-Maxx modell rendkívül hasznos állítható magasságú és keménységű sport futóművel.</em></p><br /></div><br />', 'V-Maxx Volkswagen Jetta 1, 1974-1984-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-jetta-1-1974-1984-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1427, '', '<div><strong>Jom BlueLine magasságállítható sportfutómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A Jom BlueLine futóművek kiemelkedő minőséget képviselnek, mindegyik típus specifikus. Az autó magassága a speciális állítókulcs segítségével változtatható a megadott tartományon belül.</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>- Rendelkezik 19.3 TÜV minősítéssel</div>\\r\\n\\r\\n<div>- Az alkatrészek EPS technológiával vannak porfestve és horganyzva</div>', 'Jom Bochum Volkswagen Jetta 2, 1983.08-1991.09-ig állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-jetta-2-1983-08-1991-09-ig-allithato-magassagu-futomu'),
(1428, '', '<p>A MTS-Technik által kifejlesztett sport futóművek állítható magassággal rendelkeznek, ideális választás azok számára, akik minőségi terméket kedvező áron szeretnének vásárolni. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A futómű TÜV engedéllyel rendelkezik</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Jetta 2, 1983.08-1991.09-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-jetta-2-1983-08-1991-09-ig-allithato-magassagu-futomu'),
(1429, '', '<div style=\\\"box-sizing:border-box; color:#424242; font-size:13.3333px; word-wrap:break-word\\\"> <p>Ez a magasságállítható AP-Fahrwerke futómű tökéletes választás a következő autó típusához:</p>  <ul> <li>VW Jetta 2 Elsőkerék-hajtású modellek</li> <li>19E típuskód</li> <li>Gyártási időszak: 1983.08 - 1991.09</li> <li>Elülső tengelyterhelés: 840 kg</li> <li>Hátsó tengelyterhelés: 740 kg</li> <li>Nem kompatibilis négykerék-hajtású modellekkel</li> </ul>  <ul> <li>A futómű rendelkezik Német TÜV minősítéssel</li> <li>Elülső ültetési tartomány: 40-70 mm, hátsó ültetési tartomány: 40-70 mm<br /> (A futómű szélesebb tartományban is beállítható, de a TÜV csak az említett beállításokat engedélyezi)</li> <li>Maximális ültetési lehetőség: elöl +70 mm, hátsó +50 mm</li> </ul>  <ul> <li>Gyártó: Ap-Fahrwerke Németország</li> <li>2 év garancia jár a termékre</li> </ul>  <p><strong>Cikkszám: GF80-002</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> ', 'AP made by KW Volkswagen Jetta 2, 1983.08-1991.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-jetta-2-1983-08-1991-09-ig-allithato-magassagu-futomu'),
(1430, '', '<div><strong>Vogtland állítható magasságú sport futómű a Volkswagen Golfhoz 2</strong></div> <div> </div> <div><span>Az első ültetési tartomány 40-70 mm, míg a hátsóé ugyanezen értéken belül mozog.</span><br /> <br /> <span>A maximális terhelhetőség elöl 840 kg, míg hátul 740 kg.</span><br /> <br /> <span>Ez a futóműtermék rendelkezik TÜV engedéllyel.</span></div>', 'Vogtland Volkswagen Jetta 2, 1983.08-1991.09-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-2-1983-08-1991-09-ig-allithato-magassagu-futomu'),
(1431, '', '<p>Ez az alkatrész kompatibilis a következő autótípussal:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Volkswagen Jetta</li>\\r\\n	<li>Típuskód: 1KM</li>\\r\\n	<li>Évjárat: 2006 - 2010</li>\\r\\n	<li>FIGYELEM! A futómű beépítéséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szettnek!</li>\\r\\n	<li>Tengelyterhelés elöl: 1105 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 1250 kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\\r\\n	<li>Ez a futómű rendelkezik<strong> TÜV</strong> engedéllyel!</li>\\r\\n	<li>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</li>\\r\\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\\r\\n	<li>A szett tartalma: 4 darab lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1 darab kulccsal</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Volkswagen Jetta, 2004-2010-ig, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-jetta-2004-2010-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1432, '', '<p>Ez az alkatrész kompatibilis a következő autótípusba:</p>\n\n<ul>\n	<li>Volkswagen Jetta</li>\n	<li>Típuskód: 1KM</li>\n	<li>Évjárat: 2006 - 2010</li>\n	<li>FONTOS! A futómű telepítéséhez szükséges egy rövidített stabilizátor rúd, mely nem része ennek a szettnek!</li>\n	<li>Tengelyterhelés elöl: 1106 - 1200 kg</li>\n	<li>Tengelyterhelés hátul: 1250 kg</li>\n</ul>\n\n<ul>\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\n	<li>Ez a futómű rendelkezik <strong>TÜV</strong> engedéllyel!</li>\n	<li>2 ÉVTELJESKÖRŰ GARANCIÁVAL!!!</li>\n	<li>Kiemelkedő minőség, elképesztően jó áron!!!</li>\n	<li>A csomag tartalma: 4 darab lengéscsillapító, hozzájuk tartozó rugókkal és 1 darab állítókulccsal</li>\n</ul>', 'Jom Bochum Volkswagen Jetta, 2004-2010-ig, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-jetta-2004-2010-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1433, '', '<p>Egy olyan sport futómű, melyet az Audi A3 (Typ: 8P), Audi A3 Sportback (Typ: 8P) és Audi A3 Cabrio (Typ: 8P) modellekhez terveztek. Ez az MTS-Technik állítható magasságú futómű rugóit az Eibach gyártja, melynek magassága fokozatmentesen állítható 25 és 80 mm között. A futómű gáztöltésű lengéscsillapítókat tartalmaz, melyek kiemelkedő hatékonyságot nyújtanak extrém igénybevétel mellett is. A futómű két rétegű bevonattal rendelkezik a hosszantartó korrózióvédelem érdekében, és tökéletes összhangot biztosít a rugók és a lengéscsillapítók között. A készlet könnyen telepíthető, plug & play módon működik, nem igényel módosítást az autó felfüggesztésében.</p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Jetta 5, 2005.08-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-jetta-5-2005-08-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1434, '', '<p>Audi A3 MTS-Technik állítható magasságú sport futómű</p>  <p>Ez a termék tökéletes választás azok számára, akik számára fontos a jó minőség és a kedvező ár. Az MTS-Technik állítható futóművei fokozatmentesen állítható magassággal rendelkeznek, így könnyedén beállítható az autó hasmagassága az útviszonyoknak megfelelően. A rugók és a lengéscsillapítók optimális egyensúlyban vannak egymással.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság szabadon állítható a legtöbb esetben 25 és 80 mm között</li> 	<li>gáztöltetű lengéscsillapítók</li> 	<li>magas hatékonyság extrém igénybevétel mellett is</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Jetta 5, 2005.08-tól, (első tengely terhelés 1106-1190kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-jetta-5-2005-08-tol-els-tengely-terheles-1106-1190kg-allithato-magassagu-futomu'),
(1435, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett a Volkswagen Jetta számára ideális választás. Ezt a kitűnő minőségű terméket a Volkswagen Jetta V, Typ 1KM típusú autókhoz tervezték, a lengéscsillapító ház átmérője 55 mm. Az ültetés mértéke 35 - 60 mm között állítható, és a maximális tengelyterhelés elöl 1060 kg, míg hátul 1150 kg. A futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és TÜV minősítéssel ellátottak.</p> \n<p>Az állítható magasságú futómű szett megjelenést javít, valamint maximális vezetési élményt nyújt. Az ültetés mértékének beállítása szabadon választható az egyéni igények szerint. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát biztosít az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 ültetőrugót és 4 lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p> \n<p>A Vogtland futóműve Made in Germany, és cikkszáma: 968552.</p>', 'Vogtland Volkswagen Jetta MK5, 2005.08-tól, 55mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk5-2005-08-tol-55mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1436, '', '<p>Egy olyan állítható magasságú futómű szett Volkswagen Jetta autókhoz, melynek évjárata 2005-től kezdődik. A futómű ültetés mértéke 35-60 / 35-60 mm között változhat. Ez a szett kifejezetten Volkswagen Jetta V, Typ 1KM típusú autókhoz lett tervezve, a lengéscsillapító ház átmérője pedig 50 mm. A maximális tengelyterhelés elöl 1060 kg, míg hátul 1150 kg lehet. A termék a legmagasabb minőségi elvárásoknak megfelel, és speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek a kiegyensúlyozott komfort és fokozott dinamika érdekében. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A futómű TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>A termék Made in Germany, cikkszáma: 968551.</p>', 'Vogtland Volkswagen Jetta MK5, 2005.08-tól, 50mm szárátmérő, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk5-2005-08-tol-50mm-szaratmer-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1437, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN JETTA</p>  <ul> 	<li><strong>Évjárat</strong>: 2005-től</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 60 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Volkswagen Jetta V, Typ 1KM, a lengéscsillapító ház átmérője 55 mm</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1170 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. A futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelme kiváló, és TÜV minősítéssel rendelkeznek.</p>  <p>A Vogtland gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968554</p> ', 'Vogtland Volkswagen Jetta MK5, 2005.08-tól, 55mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk5-2005-08-tol-55mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1438, '', '<strong>Vogtland</strong> állítható magasságú futómû szett: VOLKSWAGEN JETTA</p>  <ul> 	<li><strong>Évjárat</strong>: 2005-tõl</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 60 / 35 - 60 mm</li> 	<li><strong>Típus</strong>: Volkswagen Jetta V, Typ 1KM, a lengéscsillapító ház átmérõ 50 mm</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 1170 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW100GF39-40-50-69-70_1123-12.pdf</a></li> </ul>  <p>A Vogtland futómű szettje nemcsak esztétikailag fejleszti az autó megjelenését, hanem egyedülálló vezetési élményt is nyújt. A rugós ültetésű futóműkészlet lehetővé teszi az ültetés magasságának szabályozását az egyéni igények szerint. A kiváló minőségű futómű csak prémium kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott kényelmet és dinamikus teljesítményt biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó, aki több mint egy évszázados tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra!</p>  <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Made in Germany!</p>  <p>Cikkszám: 968553</p>', 'Vogtland Volkswagen Jetta MK5, 2005.08-tól, 50mm szárátmérő, (első tengely terhelés 1061-1170kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk5-2005-08-tol-50mm-szaratmer-els-tengely-terheles-1061-1170kg-allithato-magassagu-futomu'),
(1439, '', '<div><strong><span>Audi A3 (Typ: 8P) Bilstein B14 állítható magasságú futómû</span></strong><br />\\r\\n<br />\\r\\n<span>BILSTEIN egycsőves rendszer</span><br />\\r\\n<span>Fordított technológiával</span><br />\\r\\n<span>Kiváló minőségű versenysportrugók</span><br />\\r\\n<span>Állítható magasságú rendszer (alumínium rugótányér és kontra anya)</span><br />\\r\\n<span>Versenysport technológia az utcai használathoz: A BILSTEIN B14 PSS állítható magasságú futóműve lehetővé teszi a jármű magasságának csökkentését akár 50 mm-rel az első és hátsó tengelynél, 20 mm-es állítási tartományon belül. Az egyedülálló egycsőves fordított technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetési élményt minden körülmény között.</span></div>\\r\\n', 'Bilstein Volkswagen Jetta MK5, 2006.01-2010.10-ig, 50mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-jetta-mk5-2006-01-2010-10-ig-50mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1440, '', '<div><strong><span>Audi A3 (Typ: 8P) Bilstein B14 állítható magasságú futómû</span></strong><br />\\r\\n<br />\\r\\n<span>BILSTEIN egycsöves rendszerrel</span><br />\\r\\n<span>Fordított technológiát alkalmazva</span><br />\\r\\n<span>Erős versenysportrugók felhasználásával</span><br />\\r\\n<span>Állítható magasságú kivitel (alumíniumból készült rugótányér és kontra anya)</span><br />\\r\\n<span>A B14 futómű kiváló versenysport technológiát nyújt az utcai használathoz. A B14 PSS modellel a BILSTEIN mérnökei által megvalósított koncepció lehetővé teszi a jármű magasságának legfeljebb 50 mm-rel történő csökkentését az első és hátsó tengelynél, egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőséget biztosító egycsöves fordított technológia (Upside-Down) a B14 PSS modelleknél egyensúlyt teremt a kiváló menetteljesítmény és a vezetési élmény között.</span></div>\\r\\n', 'Bilstein Volkswagen Jetta MK5, 2006.01-2010.10-ig, 55mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-jetta-mk5-2006-01-2010-10-ig-55mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1441, '', '<p>A Vogtland állítható magasságú futómű szett tökéletes választás a Volkswagen Jetta VI modellekhez, a 2011-től gyártott típusokhoz. Ez a minőségi futómű rendszer lehetővé teszi az autó ültetésének szabályozását 35-65 mm között, így testre szabva az autó megjelenését és vezetési élményét. A speciális, nagy teljesítményű kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és dinamikát. Emellett korrózióvédelemmel ellátottak, így hosszú távon is kitűnő teljesítményt nyújtanak.</p> \n<p>A Vogtland futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművet használnak. </p>\n<p>Ez a minőségi termék Made in Germany, és ideális választás a Volkswagen Jetta tulajdonosok számára, akik szeretnék testre szabni autójuk futóművét és javítani vezetési élményüket.</p>\n<p>Cikkszám: 968289</p>', 'Vogtland Volkswagen Jetta MK6, 2011.01-től, 50mm szárátmérő, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk6-2011-01-tol-50mm-szaratmer-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu'),
(1442, '', '<p>A Vogtland állítható magasságú futómű szett tökéletes választás a Volkswagen Jetta tulajdonosainak, akik szeretnék javítani autójuk megjelenését és vezetési élményét. Az ültetés mértéke könnyedén szabályozható az egyéni igények szerint, és a speciális, nagy teljesítményű kétcsöves lengéscsillapítók garantálják a kiegyensúlyozott komfortot és dinamikát. Ezek a lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is kitűnő teljesítményt nyújtanak.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autókat.</p>\n<p>Ez a minőségi futómű szett ideális választás a Volkswagen Jetta VI (Typ 16, 2WD) modellekhez, ahol az első tengely terhelése legfeljebb 1035 kg, míg a maximális tengelyterhelés elöl 1035 kg, hátul pedig 1150 kg. Made in Germany!</p>\n<p>Cikkszám: 968290</p>', 'Vogtland Volkswagen Jetta MK6, 2011.01-től, 55mm szárátmérő, (első tengely terhelés 1035kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk6-2011-01-tol-55mm-szaratmer-els-tengely-terheles-1035kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1443, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN JETTA</p>  <ul> 	<li><strong>Évjárat</strong>: 2011-től</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Volkswagen Jetta VI, Typ 16, 2WD, a lengéscsillapító ház átmérője 50 mm, az első tengely terhelése legfeljebb 1160 kg</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1160 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. A beállítható ültetésnek köszönhetően testreszabhatja az autó magasságát az egyéni igényei szerint. A futómű szett kiváló minőségű, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják az egyensúlyt a kényelem és a dinamika között. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugó gyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak felszerelve.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968291</p> ', 'Vogtland Volkswagen Jetta MK6, 2011.01-től, 50mm szárátmérő, (első tengely terhelés 1036-1160kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk6-2011-01-tol-50mm-szaratmer-els-tengely-terheles-1036-1160kg-allithato-magassagu-futomu'),
(1444, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN JETTA</p>  <ul> 	<li><strong>Évjárat</strong>: 2011-től</li> 	<li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li> 	<li><strong>Típus</strong>: Volkswagen Jetta VI, Typ 16, 2WD, a lengéscsillapító ház átmérője 55 mm, az első tengely terhelése legfeljebb 1160 kg</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1160 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li> </ul>  <p>Az autó megjelenésének javítása mellett a futómű szett optimális vezetési élményt nyújt. A beállítási lehetőségek segítségével személyre szabhatja az ültetést. Ez a kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően egyensúlyt teremtenek a kényelem és a dinamika között. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968292</p> ', 'Vogtland Volkswagen Jetta MK6, 2011.01-től, 55mm szárátmérő, (első tengely terhelés 1036-1160kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-jetta-mk6-2011-01-tol-55mm-szaratmer-els-tengely-terheles-1036-1160kg-allithato-magassagu-futomu'),
(1445, '', '<div><strong><span>Audi A3 (Typ: 8P) Bilstein B14 futómű állítható magassággal</span></strong><br />\\r\\n<br />\\r\\n<span>A BILSTEIN B14 egycsöves rendszere</span><br />\\r\\n<span>Olyan technológiával rendelkezik, ahol a futómű feje tetején található</span><br />\\r\\n<span>Erős versenysportrugók felhasználásával készült</span><br />\\r\\n<span>A magasság állítható (az alumíniumból készült rugótányér és kontra anya segítségével)</span><br />\\r\\n<span>A versenysport technológia az utcára kerül a B14-gyel, melyet a BILSTEIN mérnökei fejlesztettek ki, és jelentős előnyökkel jár. A B14 PSS-ben a jármű magassága az első és hátsó tengelyen akár 50 mm-rel is csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelésre tervezett B14 PSS egycsöves futómű Upside-Down technológiája biztosítja a kiegyensúlyozott vezetési élményt és a vezetés örömét minden körülmények között.</span></div>\\r\\n', 'Bilstein Volkswagen Jetta MK6, 2010.04-től, 55mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-jetta-mk6-2010-04-tol-55mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1446, '', '<p>A Volkswagen Lupo JOM BLUE LINE állítható futóművet kifejezetten a 1998.10 - 2005 között gyártott modellekhez tervezték. Ez a futómű kiváló minőségű, és rendelkezik német nyelvű TÜV engedéllyel. A hátsó tengelynél a magasságállító a rugó alatt található. A futómű tengelyterhelése elöl 1000kg, míg hátul 950kg. A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal és az állításhoz szükséges 1 db kulccsal. Ne feledd, hogy ez a termék MADE IN GERMANY, és 2 ÉV TELJESKÖRŰ GARANCIÁVAL kapható! Kivéve: GTi és 1.2TDi 3L.</p>', 'Jom Bochum Volkswagen Lupo, kivéve GTi és 3L, 1998.10-2005-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-lupo-kiveve-gti-es-3l-1998-10-2005-ig-blue-line-allithato-magassagu-futomu'),
(1447, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik kiemelten fontosnak tartják a kiváló minőséget és az előnyös árakat. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. A rugók és a lengéscsillapítók között az MTS-Technik futóműveinél tökéletes egyensúly van.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja.</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között.</li>\n	<li>Gáztöltéses lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek).</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között.</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Lupo (Typ: 6X), összes, 1999-2005-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-lupo-typ-6x-osszes-1999-2005-ig-street-series-allithato-magassagu-futomu'),
(1448, '', '</div>\\n<div>\\n<p><em>Alkalmazkodó magasságú futóművel felszerelt Volkswagen Lupo V-Maxx</em></p>\\n</div>', 'V-Maxx Volkswagen Lupo (Typ: 6X), összes, kivéve 1.2TDi 3L, 1999-2005-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-lupo-typ-6x-osszes-kiveve-1-2tdi-3l-1999-2005-ig-allithato-magassagu-futomu'),
(1449, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombinálva, maximalizáljuk az ültetés élményét.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot személyre szabottan beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyát teremtve, optimális felépítést biztosítunk.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termékek megfizethető áron</li>\\r\\n	<li>egyéni magasságbeállítási lehetőség a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kimagasló ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Lupo (Typ: 6X, 6E), kivéve Gti és 3L, 1998.10-2005-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-lupo-typ-6x-6e-kiveve-gti-es-3l-1998-10-2005-ig-allithato-magassagu-futomu'),
(1450, '', '<div>Az Ap futómû lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy pontosan beállítsák az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</div>\\r\\n\\r\\n<div>A járműmagasság beállítására egy alumínium rugótányér szolgál, amely lehetővé teszi az egyéni beállítást a TÜV által engedélyezett tartományon belül. A sportosságot, kényelmet és biztonságot összehangoljuk egy optimális felépítés érdekében.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség megfizethető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>egyedülálló ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Lupo GTi (Typ: 6ES), 1998.10-2005-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-lupo-gti-typ-6es-1998-10-2005-ig-allithato-magassagu-futomu'),
(1451, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: VOLKSWAGEN LUPO</p>\n<ul>\n    <li><strong>Évjárat</strong>: 1998.10-2005</li>\n    <li><strong>Ültetés mértéke:</strong> 30 - 60 / 30 - 60 mm</li>\n    <li><strong>Típus</strong>: Volkswagen Lupo, Typ 6X, 6E</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 820 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 700 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a Vogtland állítható magasságú futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint lehet beállítani. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az optimális teljesítményhez.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A Vogtland már több mint 100 éves tapasztalattal rendelkező gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968555</p>', 'Vogtland Volkswagen Lupo (Typ: 6X), 1998.10-2005-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-lupo-typ-6x-1998-10-2005-ig-allithato-magassagu-futomu'),
(1452, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN LUPO</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2000.09-2005</li>\n    <li><strong>Ültetés mértéke:</strong> 20 - 50 / 30 - 60 mm</li>\n    <li><strong>Típus</strong>: Volkswagen Lupo GTI, Typ 6ES</li>\n    <li><strong>Max. tengelyterhelés elõl</strong>: 820 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 700 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett kiemelkedő vezetési élményt nyújt ez a futómű szett. Az ültetés mértéke könnyedén állítható az egyéni igények szerint. A speciális futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968087</p>', 'Vogtland Volkswagen Lupo GTi (Typ: 6ES), 2000.09-2005-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-lupo-gti-typ-6es-2000-09-2005-ig-allithato-magassagu-futomu'),
(1453, '', '<p>Ez a termék kompatibilis a következő autótípussal:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>VW New Beetle</li>\\r\\n	<li>Évjárat: 1998.01 -től</li>\\r\\n	<li>Typ.: 1Y,9C,9CR,</li>\\r\\n	<li>Tengelyterhelés elöl: 1030 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 1070 kg</li>\\r\\n	<li>Figyelem!! 4-Motion modellekhez NEM passzol!!</li>\\r\\n	<li>MADE IN GERMANY</li>\\r\\n	<li>1 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\\r\\n	<li>Kiváló minőség, hihetetlenül jó áron!!!</li>\\r\\n	<li>A szett tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</li>\\r\\n</ul>\\r\\n', 'Jom Bochum Volkswagen New Beetle, 1998.01-2010-ig állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-new-beetle-1998-01-2010-ig-allithato-magassagu-futomu'),
(1454, '', '<p><strong>A Volkswagen New Beetle FK-Automotive Állítható Magasságú és Keménységű Futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: New Beetle</li>\\r\\n	<li>Évjárat: 1998.01-2010-ig</li>\\r\\n	<li>Kivéve: 4-Motion</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>Első tengely terhelés: 1040kg</li>\\r\\n	<li>Hátsó tengely terhelés: 950kg</li>\\r\\n	<li>Elöl és hátul is állítható a magassága</li>\\r\\n	<li><strong>Állítható keménységű verzió!</strong></li>\\r\\n	<li>Nagy intervallumban módosítható a magassága</li>\\r\\n	<li>Sportos, feszes és tartós</li>\\r\\n	<li>Német nyelvű TÜV engedéllyel ellátva</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Volkswagen New Beetle, 1998.01-2010-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-new-beetle-1998-01-2010-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1455, '', '<div>\\nA Volkswagen New Beetle modellhez készült V-Maxx sport futómű egy állítható magasságú rendszer, amely lehetővé teszi a vezető számára, hogy szabályozza a jármű talajhoz való viszonyát. Ez a futómű segít javítani a jármű úttartását és stabilitását, így dinamikusabb vezetési élményt nyújt. A V-Maxx futómű kiváló minőségű anyagokból készül, és a Volkswagen New Beetle modellhez való tökéletes illeszkedést biztosítja.</div>', 'V-Maxx Volkswagen New Beetle (Typ: 9C, 1Y), beleértve Cabrio, 1998.01-2011.12-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-new-beetle-typ-9c-1y-beleertve-cabrio-1998-01-2011-12-ig-allithato-magassagu-futomu'),
(1456, '', '<strong>Volkswagen Golf 4 MTS-Technik Street állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik kiemelkedő minőséget keresnek megfizethető áron! A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes harmónia van a rugók és a lengéscsillapítók között.</p>  <p><u>Az alábbi típusokhoz alkalmas:</u></p>  <ul> 	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li> 	<li>Beleértve Variant</li> 	<li>Kivéve 4-Motion</li> 	<li>Első tengely terhelés: 1030kg</li> 	<li>Hátsó tengely terhelés: 1025kg</li> 	<li>Letölthető dokumentumok: <strong><a href=\\\"https://mtstechnik.com/data/links/942261f61a7612a96ca82867b671968b/27089_4806.pdf\\\"><span>TÜV engedély</span></a></strong>, <strong><a href=\\\"https://mtstechnik.com/data/links/29e8d2792cc0fe0725a1dd9df0d10bef/27089_4805.pdf\\\"><span>szerelési útmutató</span></a></strong></li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság legtöbb esetben 25 és 80 mm között állítható</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiváló hatékonyság extrém igénybevétel mellett</li> 	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>tökéletes összhang rugó és lengéscsillapító között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék jellemzői:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal tartalmának és képeinek jogtiszta másolása és felhasználása engedélyköteles!</em></p>  ', 'MTS-Technik by Nord Performance Volkswagen New Beetle, 1998.01-2010-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-new-beetle-1998-01-2010-ig-street-series-allithato-magassagu-futomu'),
(1457, '', '<p><strong>Volkswagen Golf 4 MTS-Technik Comfort állítható magasságú sport futómű</strong></p>\n<p><u>Az alábbi típusokhoz illeszkedik:</u></p>\n<ul>\n	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li>\n	<li>Beleértve a Variant kivitelt</li>\n	<li>Kivéve a 4-Motion változatot</li>\n	<li>Első tengely terhelése: 1030 kg</li>\n	<li>Hátsó tengely terhelése: 1025 kg</li>\n</ul>\n<p>A <strong>MTS-Technik Comfort Series állítható magasságú sport futóművei</strong> ideális választás azoknak, akik számára fontos a sportos megjelenés és az utazási kényelem egyaránt. A magasság fokozatmentesen szabályozható, így könnyedén beállítható az autó talajtól mért magassága az útviszonyoknak megfelelően. Az <strong>MTS-Technik Comfort állítható futóművei</strong> egyensúlyban vannak az <strong>Eibach gyártmányú rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az <strong>Eibach</strong> cég gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>A <strong>Comfort Series</strong> kialakításánál a hangsúlyt nem az extrém alacsonyra ültetésre, hanem a <strong>magas kényelemre</strong> helyezték</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet \"plug & play\", nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen New Beetle, 1998.01-2010-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-new-beetle-1998-01-2010-ig-comfort-series-allithato-magassagu-futomu'),
(1458, '', '<p><strong>Volkswagen Golf 4 MTS-Technik Sport állítható magasságú sport futómű</strong></p>  \n<p><u>A következő típuskhoz illik:</u></p>  \n<ul>  \n	<li><strong>Volkswagen Golf 4, </strong>1.4 16V / 1.6 / 1.6 16V / 1.6FSI / 1.8 / 1.8T / 1.8T GTI / 2.0 / 2.3 V5 / 1.9SDI / 1.9TDI</li>  \n	<li>Beleértve Variant</li>  \n	<li>Kivéve 4-Motion</li>  \n	<li>Első tengely terhelés: 1030kg</li>  \n	<li>Hátsó tengely terhelés: 1025kg</li> </ul>  \n<p>Az <strong>MTS-Technik Sport sorozatú állítható magasságú sport futómű</strong> ideális választás azok számára, akik nem szeretnének kompromisszumot kötni. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága. Az <strong>MTS-Technik Sport állítható futóművei</strong> tökéletes összhangban vannak az <strong>Eibach gyártotta rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>. A széles ültetési tartomány és a maximális vezetési élmény garantált.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>  \n	<li>a <strong>Sport sorozat</strong> kialakításakor a fokozott vezetési élmény mellett a szélesebb ültetési tartomány volt a fő szempont</li>  \n	<li>gáztöltéses lengéscsillapítók</li>  \n	<li>kiemelkedő hatékonyság extrém körülmények között is</li>  \n	<li>két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  \n<p><u><strong>Termék jellemzői:</strong></u></p>  \n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>  \n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>  ', 'MTS-Technik by Nord Performance Volkswagen New Beetle, 1998.01-2010-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-new-beetle-1998-01-2010-ig-sport-series-allithato-magassagu-futomu'),
(1459, '', '<div> \\nA Volkswagen New Beetle V-Maxx kategóriájában kiemelkedő választás az állítható magasságú és keménységű sport futóműnek köszönhetően.', 'V-Maxx Volkswagen New Beetle (Typ: 9C, 1Y), beleértve Cabrio, 1998.01-2011.12-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-new-beetle-typ-9c-1y-beleertve-cabrio-1998-01-2011-12-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1460, '', 'Az állítható futómű, melyet a Volkswagen New Beetle AP készített, kompatibilis a különböző motorváltozatokkal rendelkező Volkswagen New Beetle és New Beetle Cabrio modellekhez. Ez a futómű ideális a 9C és 1Y típuskódú modellekhez, melyek gyártási évei 1998.01-2011.12 közötti időszakra esnek. A futómű terhelési határai elöl 1035 kg alatt, hátul 850 kg alatt vannak. Az ültetés mértéke elöl és hátul 30-65mm között állítható. A futómű stabilizátor felfogatási ponttal rendelkezik az első részen, lehetővé téve a 4-Motion stabilizátor rúd használatát az 2WD modellekhez is. Javasolt egyéb kiegészítőként nyomtávszélesítő felszerelése gyári méretű gumi és felnikombináció esetén. Nagyobb átmérőjű feltengelyű modelleknél a jobb oldali féltengely mozgásának javítása érdekében ajánlott a stabilizátorrúd cseréje. A futóműszett Német nyelvű TÜV engedéllyel rendelkezik, amely meghatározza az elülső és hátsó ültetés mértékeit. A KW által gyártott futóműszett 2 év garanciával rendelkezik, cikkszáma: 11510005. Az ár 1 szettre vonatkozik.', 'AP made by KW Volkswagen New Beetle (Typ: 9C, 1Y), beleértve Cabrio, 1998.01-2011.12-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-new-beetle-typ-9c-1y-beleertve-cabrio-1998-01-2011-12-ig-allithato-magassagu-futomu'),
(1461, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelel Volkswagen Beetle modellekhez, beleértve a Volkswagen New Beetle típusokat is. Az érvjárat 1998-tól 2010-ig terjed. A futómű ültetése 30-50 mm között állítható mind elöl, mind hátul.</p> \n\n<p>Ez a minőségi futómű szett kizárólag kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott komfortérzetet és növelik a dinamikát. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek, így hosszú távú használatra tervezettek.</p> \n\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p> \n\n<p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek más típusú futóművet használnak.</p> \n\n<p>Made in Germany!</p> \n\n<p>Cikkszám: 968536</p>', 'Vogtland Volkswagen New Beetle, beleértve Cabrio, 1998.01-2010-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-new-beetle-beleertve-cabrio-1998-01-2010-ig-allithato-magassagu-futomu'),
(1462, '', '<div><strong>Volkswagen Golf 4 Bilstein B14 sport futómű állítható magassággal</strong></div>  \n<div>Ültetés mértéke az első tengelyen: 25 - 45 mm</div>  \n<div>Ültetés mértéke a hátsó tengelyen: 20 - 40 mm</div>  \n<div>Első tengely terhelése: 1060 kg</div>  \n<div>Hátsó tengely terhelése: 1010 kg</div>  \n<div>Az termék rendelkezik TÜV engedéllyel!</div>  ', 'Bilstein Volkswagen Beetle, 2000.10-2011.03-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-beetle-2000-10-2011-03-ig-bilstein-b14-allithato-magassagu-futomu'),
(1463, '', '<strong>Volkswagen Passat 35i JOM BLUE LINE állítható futómű</strong></p>\\r\\n\\r\\n<p>Az autó típusa: Passat 35i, beleértve a Variant (Typ 35i) változatot is, kivéve a Syncro modelleket.</p>\\r\\n\\r\\n<p>A futómű gyártási éve: 1988.03 - 1996.10</p>\\r\\n\\r\\n<p>A futómű tengelyterhelése elöl: 1020 kg, hátul: 1020 kg</p>\\r\\n\\r\\n<p>A termék MADE IN GERMANY</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, amit a csomag tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>Kiemelkedő minőségű termék hihetetlenül jó áron!</p>\\r\\n\\r\\n<p>A szett tartalma: 4db lengéscsillapító rugókkal és 1db állítókulccsal</p>', 'Jom Bochum Volkswagen Passat 35i, beleértve Variant, kivéve Syncro, 1988.03-1996.10-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-passat-35i-beleertve-variant-kiveve-syncro-1988-03-1996-10-ig-blue-line-allithato-magassagu-futomu'),
(1464, '', '<p>Egy állítható magasságú sport futómű, melyet a Volkswagen Passat B3, B4 modellekhez terveztek, beleértve a Variant változatot is. Nem kompatibilis a Syncro változattal. Az első ültetési tartomány 40-80 mm, míg a hátsó részen nútokkal állítható -40, 50, 60 mm-re. Fontos kiemelni, hogy a termék rendelkezik TÜV engedéllyel.</p>', 'V-Maxx Volkswagen Passat 35i, beleértve Variant, kivéve Syncro, 1988.03-1996.10-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-35i-beleertve-variant-kiveve-syncro-1988-03-1996-10-ig-allithato-magassagu-futomu'),
(1465, '', '<strong>Volkswagen Golf 3 Syncro MTS-Technik Street Series állítható magasságú sport futómű</strong></p>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az elérhető ár. Az állítható magasság lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyát nyújtják. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> cég gyártja</li> 	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li> 	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><u><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></u></p>  <p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Passat 35i, csak Syncro, 1987.09-1997-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-35i-csak-syncro-1987-09-1997-ig-street-series-allithato-magassagu-futomu'),
(1466, '', '<p>Egy állítható magasságú sport futómű, mely tökéletesen illeszkedik a Volkswagen Passat B3 és B4 modellekhez. Ez az MTS-Technik Street Series futómű lehetővé teszi az autó hasmagasságának könnyed beállítását a rugalmasság érdekében. A futómű rendelkezik TÜV engedéllyel, és ideális választás azoknak, akik minőségi és megfizethető terméket keresnek.</p>\n\n<p>A futómű jellemzői:</p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Passat 35i, kivéve Syncro, 1988.02-1997.12-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-35i-kiveve-syncro-1988-02-1997-12-ig-street-series-allithato-magassagu-futomu'),
(1467, '', '<strong>MTS-Technik Comfort Series állítható magasságú sport futómű Volkswagen Passat B3, B4 modellekhez</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat B3 Sedan,</strong> 1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\\r\\n	<li><strong>Volkswagen Passat B3 Variant, </strong>1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\\r\\n	<li><strong>Volkswagen Passat B4 Sedan,</strong> 1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\\r\\n	<li><strong>Volkswagen Passat B4 Variant, </strong>1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\\r\\n	<li>Első tengely terhelés: 1020kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1020kg</li>\\r\\n	<li>Ültetés mértéke elől: 20-80mm</li>\\r\\n	<li>Ültetés mértéke hátul: 15-80mm</li>\\r\\n	<li>Rugó erősség (első, fő rugó): 60 N/mm</li>\\r\\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\\r\\n	<li>Rugó erősség (hátsó, fő rugó): 40 N/mm</li>\\r\\n	<li>Rugó erősség (hátsó, segéd rugó): 20 N/mm</li>\\r\\n	<li>TÜV engedéllyel rendelkezik!</li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a dinamikus megjelenés mellett az utazási kényelem! A fokozatmentesen állítható magasságnak köszönhetően könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik Comfort állítható futóművei tökéletes összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\\r\\n	<li>speciális Eibach rugók a maximális kényelem érdekében</li>\\r\\n	<li>a Comfort Series létrehozása során nem az extrém ültetés, hanem a magas komfort volt a fókuszban</li>\\r\\n	<li>gáztöltéses lengéscsillapítók</li>\\r\\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termék karakterisztika:</u></p>\\r\\n\\r\\n<p><u><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></u></p>\\r\\n\\r\\n<p><em>A weboldal szöveges tartalmának, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Passat 35i, kivéve Syncro, 1988.02-1997.12-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-35i-kiveve-syncro-1988-02-1997-12-ig-comfort-series-allithato-magassagu-futomu'),
(1468, '', '<p><strong>Volkswagen Passat B3, B4 MTS-Technik Sport Series állítható magasságú sport futómű</strong></p>\n\n<ul>\n	<li><strong>Volkswagen Passat B3 Sedan,</strong> 1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\n	<li><strong>Volkswagen Passat B3 Variant,</strong> 1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\n	<li><strong>Volkswagen Passat B4 Sedan,</strong> 1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\n	<li><strong>Volkswagen Passat B4 Variant,</strong> 1.6 / 1.8 / 1.8 16V / 2.0 / 2.0 16V / 2.8 VR6 / 1.6TD / 1.9D / 1.9TD / 1.9TDI</li>\n	<li>Első tengely terhelés: 1020kg</li>\n	<li>Hátsó tengely terhelés: 1020kg</li>\n	<li>Ültetés mértéke elől: 20-80mm</li>\n	<li>Ültetés mértéke hátul: 15-80mm</li>\n	<li>Rugó erősség (első, fő rugó): 80 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>Rugó erősség (hátsó, segéd rugó): 20 N/mm</li>\n	<li>TÜV engedéllyel rendelkezik!</li>\n</ul>\n\n<p>A <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> ideális választás azoknak, akiknek fontos a vezetési élmény és a rugalmasság. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművei a legjobb minőségű Eibach rugókkal és MTS-Technik lengéscsillapítókkal rendelkeznek, biztosítva ezzel a maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> maximális sportosságot biztosítanak</li>\n	<li>a <strong>Sport Series</strong> célja a széles ültetési tartomány és fokozott vezetési élmény</li>\n	<li>gáztöltetű lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel mellett</li>\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><u><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></u></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Passat 35i, kivéve Syncro, 1988.02-1997.12-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-35i-kiveve-syncro-1988-02-1997-12-ig-sport-series-allithato-magassagu-futomu'),
(1469, '', '<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetőknek arra, hogy milliméterre pontosan beállítsák a kívánt ültetést, így a sportos irányíthatóságot és optimális vezetési tulajdonságokat kombinálhatják a maximális ültetéssel.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban, így biztosítva a sportosságot, kényelmet és biztonságot egy optimális felépítésben.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőség elérhető áron</li>\\r\\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\\r\\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>különleges ár/érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Passat 35i, kivéve Syncro, 1988.04-1996.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-35i-kiveve-syncro-1988-04-1996-09-ig-allithato-magassagu-futomu'),
(1470, '', '<p><strong>Futómű tuning szett a Vogtlandtól Volkswagen Passat autóhoz</strong></p>\n<ul>\n    <li><strong>Évjárat</strong>: 1988.04-1996.09</li>\n    <li><strong>Ültetés mértéke:</strong> 40 - 70 / 30 - 70 mm</li>\n    <li><strong>Típus</strong>: Volkswagen Passat, Typ 35i, 2WD, Lim. / Sedan, Variant</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: 1020 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1020 kg</li>\n    <li> </li>\n</ul>\n<p>A Vogtland állítható magasságú futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be, így személyre szabott vezetési élményben lehet része. A futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hosszú távon is megbízható teljesítményt nyújtanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p>\n<p>A szett alapból 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968368</p>', 'Vogtland Volkswagen Passat 35i, kivéve Syncro, 1988.04-1996.09-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-35i-kiveve-syncro-1988-04-1996-09-ig-allithato-magassagu-futomu'),
(1471, '', '<p>Egy állítható magasságú sport futómű a VW Passat 3B, 3BG modellekhez, JOM BLUE LINE néven. Ez a futómű ideális választás azok számára, akik szeretnék testre szabni autójuk futóművét. A csomag tartalmazza az első és hátsó toronycsapágyakat, így biztosítva a teljes körű kényelmet és biztonságot az autóvezetés során.</p>\n<p>A futómű megfelel a 3B és 3BG típuskódú Passat modellekhez, az években 1996.08 és 2005.05 között gyártottakhoz. Fontos megjegyezni, hogy nem kompatibilis a Syncro és 4-Motion változatokkal.</p>\n<p>Az első tengelyterhelés 1250 kg, míg a hátsó tengelyterhelés 1025 kg. A termék MADE IN GERMANY minőséget képvisel, és rendelkezik német nyelvű TÜV engedéllyel, mely garantálja a termék minőségét és biztonságát.</p>\n<p>A futómű 2 ÉV TELJESKÖRŰ GARANCIÁVAL rendelkezik, így biztos lehet benne, hogy hosszú távon is megfelelően fog működni. A szett tartalmazza 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot.</p>\n<p>Ne hagyja ki ezt a kiváló minőségű futóművet, melyet hihetetlenül jó áron kínálunk!</p>', 'Jom Bochum Volkswagen Passat 3B, 3BG, kivéve Syncro és 4-Motion, 1996.08-2005.05-ig, Blue Line, toronycsapágyakkal állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-passat-3b-3bg-kiveve-syncro-es-4-motion-1996-08-2005-05-ig-blue-line-toronycsapagyakkal-allithato-magassagu-futomu'),
(1472, '', '<p>A Volkswagen Passat 3B, 3BG modellekhez készült MTS-Technik állítható magasságú sport futóművek ideális választások azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és kedvező ár-érték arányt. A futóművek magassága fokozatmentesen állítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóművei kiváló egyensúlyt teremtenek a rugók és lengéscsillapítók között.</p>\n<p><u>Fontos tulajdonságok:</u></p>\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A termék rendelkezik TÜV engedéllyel</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>A futómű tökéletes egyensúlyt biztosít a rugók és lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Passat 3B/3BG, kivéve 4-Motion és Syncro, 1996.08-2005.05-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-3b3bg-kiveve-4-motion-es-syncro-1996-08-2005-05-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1473, '', '<p>Egy olyan autófutómű, amelynek magassága állítható az MTS-Technik által, ideális választás azoknak, akik számára fontos a jó minőség és az ár. A magasság fokozatmentesen beállítható az útviszonyoknak megfelelően, lehetővé téve az autó alvázának könnyű beállítását. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach cég gyártja.</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható.</li>\n	<li>Gáztöltésű lengéscsillapítók.</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is.</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében.</li>\n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között.</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében.</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Passat 3B, 3BG, csak Syncro és 4-Motion, 1996.08-2005.05-ig, (első tengely terhelés 1200kg alatt), Street állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-3b-3bg-csak-syncro-es-4-motion-1996-08-2005-05-ig-els-tengely-terheles-1200kg-alatt-street-allithato-magassagu-futomu'),
(1474, '', '<p><strong>Módosítható magasságú sport futómű Volkswagen Passat járművekhez</strong></p>  <ul> <li><strong>Volkswagen Passat 3B Sedan, </strong>1.8T syncro / 2.0 syncro / 2.3 VR5 syncro / 2.8 V6 syncro / 1.9TDI syncro / 2.5TDI syncro</li> <li><strong>Volkswagen Passat 3B Variant, </strong>1.8T syncro / 2.0 syncro / 2.3 VR5 syncro / 2.8 V6 syncro / 1.9TDI syncro / 2.5TDI syncro</li> <li><strong>Volkswagen Passat 3BG Sedan, </strong>1.8T 4motion / 2.0 4motion / 2.3 VR5 4motion / 2.8 V6 4motion / 1.9TDI 4motion / 2.5TDI 4motion</li> <li><strong>Volkswagen Passat 3BG Variant, </strong>1.8T 4motion / 2.0 4motion / 2.3 VR5 4motion / 2.8 V6 4motion / 1.9TDI 4motion / 2.5TDI 4motion</li> <li>első tengely terhelés 1201-1350kg</li> <li>csak Syncro és 4-Motion modellekhez</li> <li>TÜV: <a href=\\\"https://mtstechnik.com/data/links/6d881208cce1290eacbd4211cb277151/30360_6690.pdf\\\">Link a TÜV tanúsítványhoz</a></li> <li>Ültetés mértéke elöl: 25-70mm</li> <li>Ültetés mértéke hátul: 25-70mm</li> </ul>  <p>Az MTS-Technik által kifejlesztett módosítható magasságú sport futóművek ideális választást nyújtanak azoknak, akik számára fontos a kiváló minőség és az elérhető ár. A futóművek magassága fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók harmonikus együttműködése biztosítja az optimális teljesítményt.</p>  <p><u>Termékjellemzők:</u></p>  <ul> <li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li> <li>a magasság szabadon állítható általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiváló hatékonyság extrém körülmények között is</li> <li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> <li>ideális egyensúly a rugók és a lengéscsillapítók között</li> <li>a felszerelés plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Passat 3B, 3BG, csak Syncro és 4-Motion, 1996.08-2005.05-ig, (első tengely terhelés 1201-1305kg), Street állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-3b-3bg-csak-syncro-es-4-motion-1996-08-2005-05-ig-els-tengely-terheles-1201-1305kg-street-allithato-magassagu-futomu'),
(1475, '', '<strong>Volkswagen Passat 3B, 3BG MTS-Technik állítható magasságú sport futómű</strong></p>  <ul> 	<li>Sedan és Variant</li> 	<li>Kivéve Syncro és 4-Motion</li> 	<li>Első tengely terhelés 1101-1200kg</li> </ul>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár! A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveinél tökéletes egyensúlyban vannak a rugók és a lengéscsillapítók.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li><strong>A termék rendelkezik TÜV engedéllyel</strong></li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiváló hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat biztosít hosszantartó korrózióvédelmet (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Ideális egyensúly a rugók és a lengéscsillapítók között</li> 	<li>A készlet szinte azonnal használható, nem igényel módosítást az autó felfüggesztésében</li> </ul> ', 'MTS-Technik by Nord Performance Volkswagen Passat 3B/3BG, kivéve 4-Motion és Syncro, 1996.08-2005.05-ig, (első tengely terhelés 1101-1200kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-3b3bg-kiveve-4-motion-es-syncro-1996-08-2005-05-ig-els-tengely-terheles-1101-1200kg-allithato-magassagu-futomu'),
(1476, '', '<div>\n<p>A Volkswagen Passat 3B és 3BG modellekhez készült sport futómű egyedi beállítható magasságot és keménységet biztosít. Ez a futómű lehetővé teszi, hogy személyre szabott módon állítsd be az autód futóművét, így növelve a vezetési élményt és teljesítményt.</p>\n</div>', 'V-Maxx Volkswagen Passat 3B/3BG, kivéve 4-Motion és Syncro, 1996.08-2005.05-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3b3bg-kiveve-4-motion-es-syncro-1996-08-2005-05-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1477, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy pontosan beállítsák az általuk kívánt üléspozíciót milliméteres pontossággal. A sportos irányíthatóságot és optimális vezetési tulajdonságokat kombináljuk a maximális üléspozícióval.</span></div>\\r\\n\\r\\n<div>\\r\\n<div>A járműmagasság beállítható egy alumínium rugótányér segítségével a TÜV által engedélyezett tartományon belül. A sportosságot, kényelmet és biztonságot összehangolva optimális felépítést biztosítunk.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>magas minőség alacsony áron</li>\\r\\n	<li>egyéni járműmagasság beállítás a TÜV által engedélyezett tartományon belül</li>\\r\\n	<li>kiemelkedő minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiváló ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n\\r\\n<div>Fontos! Csak a járműmagasság állítható ezzel a futóművel, a keménység nem!</div>\\r\\n</div>\\r\\n', 'AP made by KW Volkswagen Passat 3B, 3BG, kivéve Syncro és 4-Motion, 1996.08-2005.05-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-3b-3bg-kiveve-syncro-es-4-motion-1996-08-2005-05-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1478, '', '<div>\n<div>Az Ap futómű olyan lehetőséget kínál a sportosan ambiciózus vezetőknek, hogy milliméterre pontosan beállítsák a kívánt üléspozíciót. Egyesítjük a sportos irányíthatóságot és az optimális vezetési tulajdonságokat a maximális ülésmagassággal.</div>\n<div>A járműmagasság beállítására egy alumínium rugótányér szolgál, mely lehetővé teszi az egyéni beállítást a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes összehangolása egy optimális konfigurációt eredményez.</div>\n<ul>\n<li>kiváló minőség megfizethető áron</li>\n<li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n<li>egyedülálló ár/érték arány</li>\n<li>német minőség</li>\n</ul>\n<div>Fontos tudnivaló! Ezen futómű esetében csak a magasság állítható! A keménység nem módosítható!</div>\n</div>', 'AP made by KW Volkswagen Passat 3B, 3BG, kivéve Syncro és 4-Motion, 1996.08-2005.05-ig, (első tengely terhelés 1100kg fölött) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-3b-3bg-kiveve-syncro-es-4-motion-1996-08-2005-05-ig-els-tengely-terheles-1100kg-folott-allithato-magassagu-futomu'),
(1479, '', '<div><strong>Volkswagen Passat 3B, 3BG sport futómű állítható magassággal</strong></div> <div> </div> <div>Kivétel: Syncro és 4-Motion változatok</div> <div>Ültetési tartomány az elülső tengelyen: 40-70mm</div> <div>Ültetési tartomány a hátsó tengelyen: 30-70mm</div> <div> </div> <div>Első tengely terhelési limitje: 1000 kg felett</div> <div> </div> <div>Az alkatrész rendelkezik TÜV engedéllyel!</div> </div>', 'Vogtland Volkswagen Passat 3B, 3BG, kivéve Syncro és 4-Motion, 1996.08-2005.05-ig, (első tengely terhelés 1100kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3b-3bg-kiveve-syncro-es-4-motion-1996-08-2005-05-ig-els-tengely-terheles-1100kg-folott-allithato-magassagu-futomu'),
(1480, '', '<div> <div><strong>Volkswagen Passat 3B, 3BG állítható magasságú sport futómû</strong></div> <div> </div> <div>Kivéve: Syncro és 4-Motion</div> <div>Ültetési tartomány elõl: 40-70mm</div> <div>Ültetési tartomány hátul: 30-70mm</div> <div> </div> <div>Elsõ tengely terhelés 1000 kg alatt</div> <div> </div> <div>Az áru rendelkezik TÜV tanúsítvánnyal!</div> </div>', 'Vogtland Volkswagen Passat 3B, 3BG, kivéve Syncro és 4-Motion, 1996.08-2005.05-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3b-3bg-kiveve-syncro-es-4-motion-1996-08-2005-05-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1481, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN PASSAT</p>  <ul> 	<li><strong>Évjárat</strong>: 1997-2005</li> 	<li><strong>Ültetés mértéke:</strong> 40 - 70 / 30 - 70 mm</li> 	<li><strong>Típus</strong>: Volkswagen Passat, Typ 3B, 3BG, 4WD, Lim. / Sedan, Variant</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: 1200 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li> 	<li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF12-17_1543-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW800GF12-17_1543-10.pdf</a></li> </ul>  <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint lehet beállítani. A kiváló minőségű futómű tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók korrózióvédelme első osztályú.</p>  <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>  <p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet alkalmaznak.</p>  <p>Németországban gyártva!</p>  <p>Cikkszám: 968370</p> ', 'Vogtland Volkswagen Passat 3B, 3BG, csak Syncro és 4-Motion, 1997-2005-ig, (első tengely terhelés 1101-1200kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3b-3bg-csak-syncro-es-4-motion-1997-2005-ig-els-tengely-terheles-1101-1200kg-allithato-magassagu-futomu'),
(1482, '', '<p>Vogtland által gyártott állítható magasságú futómű szett a VOLKSWAGEN PASSAT számára. Megfelel az 1997-2005 közötti évekhez, és az ültetés mértéke 40 - 70 / 30 - 70 mm között állítható. Kompatibilis a Volkswagen Passat Typ 3B, 3BG, 4WD, Limousine / Sedan és Variant modellekkel. A maximális tengelyterhelés elöl 1100 kg, míg hátul 1160 kg. A termék TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A futómű szett tartalmazza a 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve a szintezős vagy torziós futóművel szerelt autókat. Kiváló minőségű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerrel rendelkeznek a kiegyensúlyozott komfort és dinamika érdekében. A lengéscsillapítók korrózióvédelemmel rendelkeznek. Made in Germany! Cikkszám: 968369</p>', 'Vogtland Volkswagen Passat 3B, 3BG, csak Syncro és 4-Motion, 1997-2005-ig, (első tengely terhelés 1100kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3b-3bg-csak-syncro-es-4-motion-1997-2005-ig-els-tengely-terheles-1100kg-alatt-allithato-magassagu-futomu'),
(1483, '', '<strong>Bilstein B14 állítható magasságú futómű</strong><br /> <br /> Az egyedi BILSTEIN egycsöves rendszer <br /> Az innovatív Upside-Down technológia alkalmazása <br /> Kiváló minőségű versenysportrugók felhasználásával <br /> Az állítható magasság lehetősége alumíniumból készült rugótányér és kontra anya segítségével <br /> A B14 modellel a BILSTEIN mérnökei a versenysport technológiát átvitték az utcai használatba, aminek jelentős előnyei vannak. A B14 PSS futóműnél a jármű magassága az első és hátsó tengelynél akár 50 mm-rel is csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőséget biztosító B14 PSS egycsöves Upside-Down technológiája garantálja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden körülmény között.</p> ', 'Bilstein Volkswagen Passat 3BG, kivéve 4-Motion, 2000.11-2005.05-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-passat-3bg-kiveve-4-motion-2000-11-2005-05-ig-bilstein-b14-allithato-magassagu-futomu'),
(1484, '', '<strong>Bilstein B14 állítható magasságú futómű</strong><br /> <br /> A BILSTEIN egyedi egycsöves rendszere<br /> Speciális Upside-Down technológiával készült<br /> Kiváló minőségű versenysport rugók<br /> Az állítható magasságú futóművek alumíniumból készült alkatrészekkel rendelkeznek, lehetőséget adva a magasság finomhangolására. A B14 modell lehetővé teszi az autó magasságának akár 50 mm-rel történő csökkentését mind az első, mind a hátsó tengelynél, egy 20 mm-es állítási tartományon belül. A B14 futómű extrém körülmények között is kiváló teljesítményt nyújt az egycsöves Upside-Down technológiának köszönhetően, biztosítva ezzel a kiegyensúlyozott vezetési élményt és a vezetési örömöt.</p>', 'Bilstein Volkswagen Passat 3B, kivéve Syncro, 1996.08-2000.11-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-passat-3b-kiveve-syncro-1996-08-2000-11-ig-bilstein-b14-allithato-magassagu-futomu'),
(1485, '', '<div><strong>Bilstein B14 állítható magasságú futómű</strong><br />\\r\\n<br />\\r\\nEgy csőrendszerrel ellátott BILSTEIN futómű, mely Upside-Down technológiát alkalmaz.<br />\\r\\nA versenysportrugók nagy szilárdságú anyagból készülnek.<br />\\r\\nAz állítható magasság lehetőséget biztosít a rugótányér és a kontra anya alumíniumból történő gyártásával.<br />\\r\\nA B14 futómű a versenysport technológiát hozza az utcára a BILSTEIN mérnökei által megvalósítva. A B14 PSS-nél a jármű magassága az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű B14 PSS egycsöves Upside-Down technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét minden helyzetben.</div>\\r\\n', 'Bilstein Volkswagen Passat 3BG 4-Motion, 2000.11-2005.05-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-passat-3bg-4-motion-2000-11-2005-05-ig-bilstein-b14-allithato-magassagu-futomu'),
(1486, '', '<div><strong>Bilstein B14 állítható magasságú futómű</strong><br />\\r\\n<br />\\r\\nAz egyedülálló BILSTEIN egycsöves rendszer<br />\\r\\nSpeciális Upside-Down technológiával készült<br />\\r\\nKiváló minőségű versenysportrugók felhasználásával<br />\\r\\nAz állítható magasság lehetőséget biztosít a rugótányér és a kontra anya alumíniumból történő elkészítésével<br />\\r\\nA B14 futóművet a BILSTEIN mérnökei úgy tervezték, hogy versenysport technológiát hozzanak az utcai autózásba. A B14 PSS segítségével a jármű magassága az első és hátsó tengelynél akár 50 mm-rel is csökkenthető egy 20 mm-es állítási tartományon belül. Az extrém terhelhetőségű B14 PSS futómű Upside-Down technológiája biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét bármely helyzetben.</div>\\r\\n', 'Bilstein Volkswagen Passat 3B Syncro, 1996.08-2000.11-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-passat-3b-syncro-1996-08-2000-11-ig-bilstein-b14-allithato-magassagu-futomu'),
(1487, '', '<p>Ez az alkatrész kompatibilis a Volkswagen Passat 4-Motion típusú autókkal, melyek típuskódja 3C, és az évjárataik 2006-tól 2010-ig terjednek, beleértve a Variant modelleket is.</p>\n\n<p>A futómű beszereléséhez rövidített stabilizátor szettet ajánlott használni, mely nem tartalmazza a kompatibilis cikkszámokat: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix).</p>\n\n<p>A tengelyterhelés elöl 1200 kg, míg hátul 1250 kg.</p>\n\n<ul>\n	<li>MADE IN GERMANY</li>\n	<li>Ez a futómű rendelkezik TÜV engedéllyel, melyet a csomagolás tartalmaz.</li>\n	<li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\n	<li>Kiváló minőség, hihetetlenül jó áron!!!</li>\n	<li>A szett tartalma: 4db lengéscsillapító a hozzá tartozó rugókkal és az állításhoz szükséges 1db kulccsal</li>\n</ul>', 'Jom Bochum Volkswagen Passat 3C 4-Motion, beleértve Variant, 2005-2014-ig, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-passat-3c-4-motion-beleertve-variant-2005-2014-ig-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(1488, '', '<p>Ez az alkatrész kompatibilis a következő autótípussal:</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Volkswagen Passat</li>\\r\\n	<li>Típuskód: 3C</li>\\r\\n	<li>Évjárat: 2006 - 2010</li>\\r\\n	<li>Beleértve Variant</li>\\r\\n	<li>Kivéve 4-Motion</li>\\r\\n	<li><strong>A javasolt futóműbeszereléshez rövidített stabilizátor szett ajánlott! Az alkatrész nem tartalmazza ezt a kiegészítőt. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n	<li>Tengelyterhelés elöl: 1106 - 1200 kg</li>\\r\\n	<li>Tengelyterhelés hátul: 1250 kg</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>GYÁRTVA NÉMETORSZÁGBAN</li>\\r\\n	<li>Ez a futómű <strong>TÜV</strong> által jóváhagyott, amit a csomagolás tartalmaz.</li>\\r\\n	<li>2 ÉVES TELJESKÖRŰ GARANCIÁVAL!!!</li>\\r\\n	<li>Kiemelkedő minőség, lenyűgöző áron!!!</li>\\r\\n	<li>A készlet tartalma: 4 db lengéscsillapító, hozzájuk tartozó rugókkal és 1 db állítókulccsal</li>\\r\\n</ul>', 'Jom Bochum Volkswagen Passat 3C, beleértve Variant, kivéve 4-Motion, 2005-2014-ig, (első tengely terhelés 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-passat-3c-beleertve-variant-kiveve-4-motion-2005-2014-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1489, '', '<p>A termék kompatibilis a Volkswagen Passat típussal, melynek típuskódja 3C, és az évjárat 2006-tól 2010-ig terjed. A Variant modellekhez megfelelő, de a 4-Motion típusúakhoz nem ajánlott. A futómű beszereléséhez rövidített stabilizátor szett ajánlott, mely nem része a csomagnak. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix). Az elülső tengelyterhelés 1105 kg, míg a hátsóé 1250 kg.</p>\n\n<p>A termék MADE IN GERMANY, TÜV engedéllyel rendelkezik, melyet a csomag tartalmaz. 2 ÉV TELJESKÖRŰ GARANCIÁVAL!!! Kiváló minőségű termék hihetetlenül jó áron! A szett tartalmazza: 4db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1db kulcsot.</p>', 'Jom Bochum Volkswagen Passat 3C, beleértve Variant, kivéve 4-Motion, 2005-2014-ig, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-passat-3c-beleertve-variant-kiveve-4-motion-2005-2014-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1490, '', '<div><strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">A Volkswagen Passat 3C V-Maxx futóművének lehetősége van a magasság állítására<br /></strong></div>', 'V-Maxx Volkswagen Passat 3C 4-Motion, 2005-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-4-motion-2005-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1491, '', '<div>\n    A Volkswagen Passat 3C modelljéhez V-Maxx futóművet ajánlunk.\n</div>', 'V-Maxx Volkswagen Passat 3C, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion,2005-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion2005-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1492, '', '<div>\\n  Az 3C modellhez elérhető V-Maxx futómű állítható magassággal.\\n</div>', 'V-Maxx Volkswagen Passat 3C, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2005-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2005-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1493, '', '<div>\n  <strong>A Volkswagen Passat 3C-hoz elérhető a V-Maxx futómű, melynek magassága szabályozható.</strong>\n</div>', 'V-Maxx Volkswagen Passat 3C 4-Motion, 2005-től, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-4-motion-2005-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1494, '', '<div>\\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\\nInnovatív Volkswagen Passat 3C V-Maxx futómű átalakító rendszer, amely segít javítani az autó futómű teljesítményét és vezethetőségét.\\n</p>\\n</div>', 'V-Maxx Volkswagen Passat 3C, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, Kivéve 4-Motion, 2005-Től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2005-tl-55mm-szaratmer-allithato-magassagu-futomu'),
(1495, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nAz említett futómű lehetővé teszi az autó magasságának állítását.\n</strong>', 'V-Maxx Volkswagen Passat 3C, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion,2005-től, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion2005-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1496, '', '<p><strong>Volkswagen Passat B7 MTS-Technik Street Series állítható magasságú sport futómű</strong></p>\n    \n<p><u>A következő típusokhoz:</u></p>\n    \n<ul>\n    <li><strong>Volkswagen Passat 3C B7 Sedan,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\n    <li><strong>Volkswagen Passat 3C B7 Variant,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\n    <li>Első tengely terhelés: 1100-1180 kg</li>\n    <li>Hátsó tengely terhelés: 1230 kg alatt</li>\n    <li>Ültetés mértéke elől: 35-70 mm</li>\n    <li>Ültetés mértéke hátul: 35-60 mm</li>\n    <li><strong>A futómű beszereléséhez rövidített stabilizátor szett használata ajánlott! A szett NEM tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\n</ul>\n    \n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik értékelik a kiváló minőséget és az megfizethető árat! Az MTS-Technik futóművei lehetővé teszik a magasság fokozatmentes állítását, így könnyedén igazítható az útviszonyokhoz a jármű hasmagassága! A rugók és lengéscsillapítók között az MTS-Technik futóműveknél optimális az egyensúly.</p>\n    \n<p><u>Termékjellemzők:</u></p>\n    \n<ul>\n    <li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n    <li><strong>a termék rendelkezik TÜV engedéllyel!</strong></li>\n    <li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n    <li>gáztöltésű lengéscsillapítók</li>\n    <li>kiemelkedő hatékonyság extrém igénybevétel mellett is</li>\n    <li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n    <li>tökéletes összhang a rugók és a lengéscsillapítók között</li>\n    <li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n    \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Passat 3C (B7) Sedan és Variant, 2010.08-2014.12-ig, (első tengely terhelés 1100-1180kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-3c-b7-sedan-es-variant-2010-08-2014-12-ig-els-tengely-terheles-1100-1180kg-street-series-allithato-magassagu-futomu'),
(1497, '', '<p><strong>Volkswagen Passat B7 MTS-Technik Street Series állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p><u>Alkalmazható az alábbi típusokhoz:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Sedan</strong> különböző motorváltozatokhoz</li>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Variant</strong> különböző motorváltozatokhoz</li>\\r\\n	<li>Első tengely terhelés: 1100-1180 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1230 kg alatt</li>\\r\\n	<li>Ültetés mértéke elöl: 35-70 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-60 mm</li>\\r\\n	<li><strong>A futómű beszereléséhez rövidített stabilizátor szett ajánlott!</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik minőségi és megfizethető terméket keresnek. Az útviszonyoknak megfelelően szabadon állítható magasságú futómű könnyedén beállítható. Az MTS-Technik futóművei optimális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>TÜV engedéllyel rendelkezik</strong></li>\\r\\n	<li>A magasság szabadon állítható 25 és 80 mm között</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\\r\\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\\r\\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Passat 3C (B6) Sedan és Variant, 2005.08-2011.10-ig, (első tengely terhelés 1100-1180kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-3c-b6-sedan-es-variant-2005-08-2011-10-ig-els-tengely-terheles-1100-1180kg-street-series-allithato-magassagu-futomu'),
(1498, '', '<div><span>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy milliméter pontosan állíthassa be a kívánt ültetést. A sportos irányíthatóságot és optimális vezetési magatartást kombináljuk a maximális ültetéssel.</span></div> <div><span>Alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság párhuzamos összehangolása optimális felépítést eredményez.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Egyéni magasság beállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány<br type=\\\"_moz\\\" />     </span></li>     <li><span>Kiemelkedő ár/érték arány<br type=\\\"_moz\\\" />     </span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Volkswagen Passat 3C Sedan, 2005.03-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-3c-sedan-2005-03-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1499, '', '<div><span>Az Ap futómû lehetőséget biztosít a sportosan ambiciózus vezetőnek, hogy milliméter pontossággal állíthassa be a kívánt ültetést. Egyedülálló kombinációja a sportos irányíthatóságnak és az optimális vezetési viselkedésnek maximalizált ültetéssel.</span></div> <div><span>A járműmagasság egy alumínium rugótányér segítségével egyénileg beállítható a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmonikus egyensúlyban van az optimális konfiguráció érdekében.</span></div> <ul>     <li><span>Kiemelkedő minőség elérhető áron</span></li>     <li><span>Egyéni magasságbeállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedülálló ár-érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Volkswagen Passat 3C Variant, 2005.08-tól, (első tengely terhelés 1106-1180kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-3c-variant-2005-08-tol-els-tengely-terheles-1106-1180kg-ig-allithato-magassagu-futomu'),
(1500, '', '<div><span>Az Ap futómû lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméter pontossággal állítsák be a kívánt ülésmagasságot. Egyedi kombinációban nyújtjuk a sportos irányíthatóságot és optimális vezetési magatartást a maximális ülésmagassággal.</span></div> <div><span>A járműmagasság állítható egy alumínium rugótányér segítségével a TÜV által engedélyezett tartományon belül. Az optimális felépítés biztosítja a sportosságot, kényelmet és biztonságot egyidejűleg.</span></div> <ul>     <li><span>Kiváló minőség megfizethető áron</span></li>     <li><span>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>Kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>Egyedi ár/érték arány</span></li>     <li><span>Német minőség</span></li> </ul>', 'AP made by KW Volkswagen Passat 3C Variant, 2005.08-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-3c-variant-2005-08-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1501, '', '<div> \\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">Az állítható magasságú és keménységű V-Maxx futómű tökéletes választás lehet a Volkswagen Passat 3C autóhoz.</p> \\n</div>', 'V-Maxx Volkswagen Passat 3C 4-Motion, 2005-től, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-4-motion-2005-tol-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1502, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nAz állítható magasságú és keménységű V-Maxx futómű jellemzi a Volkswagen Passat 3C-t\n</strong>', 'V-Maxx Volkswagen Passat 3C 4-Motion, 2005-től, 50mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-4-motion-2005-tol-50mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1503, '', '<div>\n<p style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">\nAz állítható magasságú és keménységű V-Maxx futómű a Volkswagen Passat 3C modellhez.\n</p>\n</div>', 'V-Maxx Volkswagen Passat 3C, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion,2005-től, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion2005-tol-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1504, '', '<div>\n<strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">A Volkswagen Passat 3C V-Maxx futóműve lehetővé teszi a magasság és keménység szabályozását</strong>', 'V-Maxx Volkswagen Passat 3C, 1.9TDi DSG, 2.0TDi, 2.0TDi DSG, kivéve 4-Motion,2005-től, 50mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-9tdi-dsg-2-0tdi-2-0tdi-dsg-kiveve-4-motion2005-tol-50mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1505, '', '<div>\n  <strong style=\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\">A Volkswagen Passat 3C modelljének futóműve lehetőséget biztosít a magasság és keménység szabályozására.</strong>\n</div>', 'V-Maxx Volkswagen Passat 3C, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2005-től, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2005-tol-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1506, '', '<br /><div><br /><strong style=\\\"color: rgb(66, 66, 66); font-family: OpenSans-Regular, sans-serif; font-size: 13px; box-sizing: border-box;\\\">A V-Maxx futómű elérhető a Volkswagen Passat 3C modellhez, melynek magassága és keménysége szabályozható</strong><br /></div><br />', 'V-Maxx Volkswagen Passat 3C, 1.6, 2.0, 2.0T, 2.0T DSG, 1.9TDi, kivéve 4-Motion, 2005-től, 50mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-3c-1-6-2-0-2-0t-2-0t-dsg-1-9tdi-kiveve-4-motion-2005-tol-50mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1507, '', '<div>Az Ap futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméter pontosan beállítsák a kívánt ülésmagasságot. Az optimális vezetési magatartás és a sportos irányíthatóság kombinációját kínáljuk, miközben maximalizáljuk az ülésmagasságot.</div> <div>A járműmagasság egyedi beállítására alumínium rugótányér segítségével van lehetőség a TÜV által engedélyezett tartományban. Az optimális felépítést biztosítjuk, ahol a sportosság, kényelem és biztonság egyidejűleg van hangsúlyban.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>kiemelkedő ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Passat 3C Sedan, 2005.03-tól, (első tengely terhelés 1106-1160kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-3c-sedan-2005-03-tol-els-tengely-terheles-1106-1160kg-ig-allithato-magassagu-futomu'),
(1508, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN PASSAT</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2005.08-tól</li>\n    <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>\n    <li><strong>Típus</strong>: Volkswagen Passat, Typ 3C, 2WD, 4WD, Variant / Station Wagon</li>\n    <li><strong>Max. tengelyterhelés elõl</strong>: 1105kg alatt</li>\n    <li><strong>Max. tengelyterhelés hátu</strong>l: 1230 kg</li>\n</ul>\n<p>Emellett, hogy növeli az autó esztétikai vonzerejét, ez a futómű szett kiemelkedő vezetési élményt biztosít. Az egyedi beállításnak köszönhetően szabadon állíthatja az autó magasságát. Ez a kiváló minőségű futómű szett exkluzív, nagy teljesítményű lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. A lengéscsillapítók kiváló korroziónak ellenállnak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint egy évszázados tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyeknél szinterezett vagy torziós futóművet alkalmaznak.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968685</p>', 'Vogtland Volkswagen Passat 3C Variant, beleértve 4-Motion, 2005.08-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3c-variant-beleertve-4-motion-2005-08-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1509, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN PASSAT</p> <ul>     <li><strong>Évjárat</strong>: 2005.08-tól</li>     <li><strong>Ültetés mértéke:</strong> 35 - 65 / 35 - 65 mm</li>     <li><strong>Típus</strong>: Volkswagen Passat, Typ 3C, 2WD, 4WD, Variant / Station Wagon</li>     <li><strong>Max. tengelyterhelés elõl</strong>: (több mint 1105 kg) 1180 kg</li>     <li><strong>Max. tengelyterhelés hátu</strong>l: 1230 kg</li>     <li> </li> </ul> <p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. A speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítva a kiegyensúlyozott komfortérzetet és a fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, melynek több mint 100 éves tapasztalata van a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A futómű szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p> <p>Made in Germany!</p> <p>Cikkszám: 968686</p>', 'Vogtland Volkswagen Passat 3C Variant, beleértve 4-Motion, 2005.08-tól, (első tengely terhelés 1106kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3c-variant-beleertve-4-motion-2005-08-tol-els-tengely-terheles-1106kg-folott-allithato-magassagu-futomu'),
(1510, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: VOLKSWAGEN PASSAT</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2005.03-tól</li>\n    <li><strong>Ültetés mértéke:</strong> 35 - 70 / 35 - 70 mm</li>\n    <li><strong>Típus</strong>: Volkswagen Passat, Typ 3C, 2WD, 4WD, Lim. / Sedan</li>\n    <li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1105 kg</li>\n    <li><strong>Max. tengelyterhelés hátul</strong>: 1150 kg</li>\n</ul>\n<p>Az autó megjelenésén javít, miközben kimagasló vezetési élményt nyújt. Lehetőséget biztosít az ültetés mértékének személyre szabására. A készlet kizárólag prémium kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően harmonikus komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A készlet alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező- vagy torziós futóművet szereltek.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968559</p>', 'Vogtland Volkswagen Passat 3C Sedan, beleértve 4-Motion, 2005.03-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3c-sedan-beleertve-4-motion-2005-03-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1511, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN PASSAT</p>\n<ul>\n    <li><strong>Évjárat</strong>: 2005.03-tól</li>\n    <li><strong>Ültetés mértéke:</strong> 35 - 70 / 35 - 70 mm</li>\n    <li><strong>Típus</strong>: Volkswagen Passat, Typ 3C, 2WD, 4WD, Lim. / Sedan</li>\n    <li><strong>Max. tengelyterhelés elõl</strong>: (több mint 1105 kg) 1180 kg</li>\n    <li><strong>Max. tengelyterhelés hátu</strong>l: 1150 kg</li>\n    <li> </li>\n</ul>\n<p>A termék nemcsak esztétikailag javítja az autó megjelenését, hanem emellett optimális vezetési élményt biztosít. Lehetősége van személyre szabni az ültetés magasságát a saját igényei szerint. Ez a kiváló minőségű futómű szett csupán speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek a csökkentett gáztartalmú rendszernek köszönhetően garantálják az egyensúlyt a kényelem és a dinamizmus között. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó vállalat, amely több mint száz éves tapasztalattal rendelkezik a rugógyártás területén, 2 éves garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azokat az autótípusokat, amelyeknél szintező- vagy torziós futóművet alkalmaznak.</p>\n<p>Németországban gyártva!</p>\n<p>Cikkszám: 968560</p>', 'Vogtland Volkswagen Passat 3C Sedan, beleértve 4-Motion, 2005.03-tól, (első tengely terhelés 1106kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-3c-sedan-beleertve-4-motion-2005-03-tol-els-tengely-terheles-1106kg-folott-allithato-magassagu-futomu'),
(1512, '', '<p>Egy olyan futómű, amely tökéletes választás lehet azok számára, akik számára fontos a jó minőség és a kedvező ár. A magasság könnyen beállítható az útviszonyoknak megfelelően, fokozatmentesen. Az MTS-Technik futóművei optimalizált rugókkal és lengéscsillapítókkal rendelkeznek.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett</li>\n	<li>Két rétegű bevonat korrózióvédelem céljából</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Passat B2, kivéve Syncro, 1979.09-1989.06-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-b2-kiveve-syncro-1979-09-1989-06-ig-street-series-allithato-magassagu-futomu'),
(1513, '', '<strong>Audi 80 B2 MTS-Technik Street állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<ul>\n	<li>Audi 80 (B2 típus): 1.3 / 1.6 / 1.6 D / 1.6 TD / 1.8 / 1.8 GTE / 1.9 CD-5S / 2.0</li>\n	<li>kivéve Quattro</li>\n	<li>első tengely terhelés: 900kg</li>\n	<li>hátsó tengely terhelés: 860kg</li>\n	<li>ültetés mértéke elöl: 45-85mm</li>\n	<li>ültetés mértéke elöl: 25-95mm</li>\n</ul>\n\n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik értékelik a kiváló minőséget és kedvező árat! A magasság fokozatmentesen szabályozható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Kiváló hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelemért</li>\n	<li>Rugalmas összhang a rugók és a lengéscsillapítók között</li>\n	<li>Plug & play készlet, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n\n<p><u>MTSCP21SET Motorsport első állítható toronycsapágy jellemzői:</u></p>\n\n<ul>\n	<li>Állíthatóság: -2.0°</li>\n	<li>Nem kompatibilis a gyári futóművel</li>\n	<li>Toronycsapágy tömege: 770g</li>\n	<li>Az MTS Technik toronycsapágyak lehetővé teszik a kerék dőlésének beállítását</li>\n	<li>A kerék dőlésének pontos beállítása javítja az autó vezethetőségét és csökkenti a gumi kopását</li>\n	<li>Alumínium ötvözetből készült MTS Technik toronycsapágyak</li>\n	<li>CNC technológiával gyártott toronycsapágyak</li>\n	<li>Erősített G-szemmel ellátott toronycsapágyak hosszú élettartam érdekében</li>\n	<li>A MTS Technik toronycsapágyak kompatibilisek a legtöbb állítható magasságú futóművel</li>\n</ul>\n\n<p><u>Termék karakterisztika:</u></p>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Passat B2, kivéve Syncro, 1979.09-1989.06-ig, Street Series, Motorsport toronycsapágyakkal állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-b2-kiveve-syncro-1979-09-1989-06-ig-street-series-motorsport-toronycsapagyakkal-allithato-magassagu-futomu'),
(1514, '', '<p>Egy olyan futómű, amely tökéletesen illeszkedik a Volkswagen Passat B8 Variant típusokhoz, mint például a 1.4TSI, 1.4GTE Hybrid, 1.5TSI, 1.8TSI, 2.0TSI, 1.6TDI, 2.0TDI, 1.4 TSI 4motion, 2.0 TSI 4motion és 2.0 TDI 4motion. Az MTS-Technik állítható magasságú sport futóművei lehetővé teszik az autó hasmagasságának könnyed beállítását a változó útviszonyoknak megfelelően. Az optimális rugó-lengéscsillapító egyensúlyról gondoskodik.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság fokozatmentesen állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Passat B8 Variant, beleértve 4-Motion, 2014.08-tól, (első tengely terhelés 1061-1200kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-b8-variant-beleertve-4-motion-2014-08-tol-els-tengely-terheles-1061-1200kg-street-series-allithato-magassagu-futomu'),
(1515, '', '<p>A Volkswagen Passat B8 Variant MTS-Technik állítható magasságú sport futóműve ideális választás a minőségi és megfizethető árakat kereső vásárlók számára. A futóműveket fokozatmentesen lehet beállítani a különböző útviszonyoknak megfelelően, lehetővé téve az autó hasmagasságának könnyű szabályozását. Az MTS-Technik futóművei optimális összhangot biztosítanak a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>Plug & play készlet, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Passat B8 Sedan, beleértve 4-Motion, 2014.08-tól, (első tengely terhelés 1061-1200kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-b8-sedan-beleertve-4-motion-2014-08-tol-els-tengely-terheles-1061-1200kg-street-series-allithato-magassagu-futomu'),
(1516, '', '<p>Egy olyan futómű, amely tökéletesen illeszkedik a Volkswagen Passat B8 Variant típusokhoz, beleértve a különböző motorváltozatokat és tengelyterheléseket. Az MTS-Technik állítható magasságú sport futóművei ideális választás azok számára, akik fontosnak tartják a minőséget és az ár-érték arányt. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>', 'MTS-Technik by Nord Performance Volkswagen Passat B8 Sedan, beleértve 4-Motion, 2014.08-tól, (első tengely terhelés 1060kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-b8-sedan-beleertve-4-motion-2014-08-tol-els-tengely-terheles-1060kg-alatt-street-series-allithato-magassagu-futomu'),
(1517, '', '<p>Egy állítható magasságú sport futómű a Volkswagen Passat B8 Variant számára</p>\n\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választások azoknak, akik fontosnak tartják a kiváló minőséget és megfizethető árat. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei a rugók és a lengéscsillapítók optimális egyensúlyával rendelkeznek.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az Eibach gyártja</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek során is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Passat B8 Variant, beleértve 4-Motion, 2014.08-tól, (első tengely terhelés 1060kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-b8-variant-beleertve-4-motion-2014-08-tol-els-tengely-terheles-1060kg-alatt-street-series-allithato-magassagu-futomu'),
(1518, '', '<p>A Vogtland magasságállítható futómű készlet a Volkswagen Passat B8 típushoz készült. Az évjárattól függően állítható ültetés mértéke 30-55mm / 30-55mm. Ez a futómű kizárólag a Volkswagen Passat Sedan, Typ B8 típushoz, kivéve a 4-Motion változatot. Az elülső tengely maximális terhelése 1030 kg, míg a hátsó tengelyé 1250 kg.</p>\n\n<p>Ez a futómű készlet nemcsak javítja az autó megjelenését, hanapság vezetési élményt is nyújt. A beállítások lehetővé teszik az ültetés mértékének testre szabását az egyéni igények szerint. A készlet magas teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiváló kényelmet és dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak.</p>\n\n<p>A termék nem rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A készlet általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel rendelkeznek.</p>\n\n<p>Made in Germany!</p>', 'Vogtland Volkswagen Passat (Typ: B8) Sedan, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1030kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-typ-b8-sedan-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1030kg-alatt-allithato-magassagu-futomu'),
(1519, '', '<p>A Vogtland által kifejlesztett állítható magasságú futómű szett kifejezetten a 2014.11-től gyártott Volkswagen Passat B8 Sedan modellekhez lett tervezve. Ez a futómű lehetővé teszi az ültetés mértékének 35-60mm közötti beállítását mind az elülső, mind a hátsó tengelyen. Az autó megjelenésén javítva maximális vezetési élményt nyújt. A speciális futómű szett kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak a tartóssághoz.</p>  \n<p>A termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintező vagy torziós futóművel vannak szerelve.</p>  \n<p>Made in Germany!</p>', 'Vogtland Volkswagen Passat (Typ: B8) Sedan  4-Motion, 2014.11-től, (első tengely terhelés 1061-1200kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-typ-b8-sedan--4-motion-2014-11-tol-els-tengely-terheles-1061-1200kg-allithato-magassagu-futomu'),
(1520, '', '<p>A Vogtland állítható magasságú futómű készlet olyan Volkswagen Passat B8 modellekhez készült, melyek gyártása 2014. novemberétől kezdődött. Ez a futómű készlet lehetővé teszi az autó ültetésének 35-60 mm közötti módosítását, és kizárólag Passat Variant B8 típushoz alkalmas, kivéve a 4-Motion változatot.</p> \n<p>Ez a készlet nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is nyújt. A speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát, valamint első osztályú korrózióvédelmet nyújtanak. </p>\n<p>A termék nem rendelkezik TÜV minősítéssel, viszont a gyártó, aki több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A készlet általában 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>A termék Made in Germany!</p>', 'Vogtland Volkswagen Passat (Typ: B8) Variant, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1030kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-typ-b8-variant-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1030kg-alatt-allithato-magassagu-futomu'),
(1521, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a Volkswagen Passat B8 modellekhez, melyek gyártása 2014 novemberétől kezdődött. Ez a futómű kiválóan javítja az autó megjelenését és garantálja a maximális vezetési élményt. Az ültetés mértéke 35-60mm lehet, és kizárólag a Passat Sedan, Typ B8 típusú autókhoz, valamint csak 4-Motion változatokhoz használható.</p>  \n<p>Az általános specifikációk szerint a maximális tengelyterhelés elöl 1061-1200kg, míg hátul 1250kg lehet. A Vogtland futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Ezen lengéscsillapítók korrózióvédelemmel rendelkeznek, így hosszú távon is optimális teljesítményt nyújtanak.</p>  \n<p>Fontos megjegyezni, hogy a termék nem rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintezős vagy torziós futóművet szereltek.</p>  \n<p>Made in Germany!</p>', 'Vogtland Volkswagen Passat (Typ: B8) Variant, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1031-1200kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-typ-b8-variant-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1031-1200kg-allithato-magassagu-futomu'),
(1522, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás a Volkswagen Passat B8 modellekhez, kivéve a 4-Motion típust. Ez a minőségi futómű rendszer lehetővé teszi az autó megjelenésének javítását és optimális vezetési élményt nyújt. Az ültetés mértéke szabadon állítható a 35-60mm tartományban, lehetővé téve személyre szabott beállításokat. A speciális kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát, valamint kiváló korrózióvédelmet nyújtanak.</p>\n<p>Fontos tudni, hogy a termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég, amely 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintező vagy torziós futóművel rendelkező autók esetében.</p>\n<p>A Vogtland futóművek Made in Germany minőséget képviselnek, és megfelelnek a legmagasabb szabványoknak, hogy garantálják az optimális teljesítményt és tartósságot.</p>', 'Vogtland Volkswagen Passat (Typ: B8) Sedan  4-Motion, 2014.11-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-typ-b8-sedan--4-motion-2014-11-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1523, '', '<strong>Vogtland</strong> állítható magasságú futómű szett a Volkswagen Passat B8 típushoz</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2014.11-től</li>\n	<li><strong>Ültetés mértéke:</strong> 30-55mm / 30-55mm</li>\n	<li><strong>Típus</strong>: Volkswagen Passat Sedan, Typ B8, kivéve 4-Motion</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1031-1200kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1250 kg</li>\n</ul>\n<p>Az autó megjelenésén javít és kiváló vezetési élményt nyújt. Az ültetés mértéke könnyedén testreszabható az egyéni igények szerint. A futómű szett két csöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. A lengéscsillapítók kiváló korrózió elleni védelmet nyújtanak.</p>\n<p>A termék nem rendelkezik TÜV minősítéssel, azonban a gyártó cég 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra, akik már több mint 100 éves tapasztalattal rendelkeznek a rugógyártás területén.</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Made in Germany!</p>', 'Vogtland Volkswagen Passat (Typ: B8) Sedan, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1031-1200kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-typ-b8-sedan-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1031-1200kg-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1524, '', '<div>\n    <p>Ez a moduláris AP-Fahrwerke alacsonyító rendszer ideális választás a következő járműhöz:</p>\n    <ul>\n        <li>Volkswagen Passat B8 Sedan 4-Motion</li>\n        <li>Tipuskód: 3C, B8</li>\n        <li>Évjárat: 2014.11-től</li>\n        <li>Tengelyterhelés elöl (kg): 1060</li>\n        <li>Tengelyterhelés hátul (kg): 1250</li>\n        <li>Kivéve Variant</li>\n        <li>A sportfutóművel szerelt modellek esetében az ültetés mértéke csökkenhet.</li>\n        <li>Az Audi modellek esetében, amelyek Magnetride elektromágneses futóművel vannak felszerelve, a vezérlőegység deaktiválása szükséges!</li>\n    </ul>\n    <ul>\n        <li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel.</li>\n        <li>A TÜV engedélyben meghatározott ültetési intervallumok: elöl: 30-60 mm, hátul: 30-60 mm</li>\n        <li>A futómű ennél nagyobb intervallumban is beállítható, de az engedély csak a fent említett értékekre vonatkozik.</li>\n        <li>Extra ültetési lehetőség: elöl: +5 mm, hátul: +0 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: AP-Fahrwerke, Németország</li>\n        <li>Garancia: 2 év</li>\n    </ul>\n</div>', 'AP made by KW Volkswagen Passat B8 Variant, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1030kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-variant-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1030kg-alatt-allithato-magassagu-futomu'),
(1525, '', '<p>Ez a módosítható magasságú futómű az alábbi autótípushoz illeszkedik:</p>\n\n<ul>\n	<li>Volkswagen Passat B8 Sedan, 2WD</li>\n	<li>Tipuskód: 3C, B8</li>\n	<li>Évjárat: 2014.11-től</li>\n	<li>Tengelyterhelés elöl (kg): 1030</li>\n	<li>Tengelyterhelés hátul (kg): 1250</li>\n	<li>Kivéve 4-Motion és Variant<br />\n	Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.<br />\n	Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges !</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműkészlet Német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-55 mm, hátul: 30-55 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +5 mm</li>\n</ul>\n\n<ul>\n	<li>Készült Ap-Fahrwerke Németországban</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>', 'AP made by KW Volkswagen Passat B8 Sedan, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1030kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-sedan-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1030kg-alatt-allithato-magassagu-futomu'),
(1526, '', '<p>Ez az állítható magasságú futómű megfelel a következő autótípusnak:</p>\n\n<ul>\n	<li>Volkswagen Passat B8 Sedan, 2WD</li>\n	<li>Tipuskód: 3C, B8</li>\n	<li>Évjárat: 2014.11-től</li>\n	<li>Tengelyterhelés elöl (kg): 1031-1200</li>\n	<li>Tengelyterhelés hátul (kg): 1250</li>\n	<li>Kivéve 4-Motion és Variant<br />\n	Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.<br />\n	Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges !</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműszett német nyelvű TÜV engedéllyel rendelkezik!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-55 mm, hátul: 30-55 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +5 mm</li>\n</ul>\n\n<ul>\n	<li>Made In Ap-Fahrwerke Németország</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>', 'AP made by KW Volkswagen Passat B8 Sedan, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1031-1200kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-sedan-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1031-1200kg-allithato-magassagu-futomu'),
(1527, '', '<div>\n	<p>Ez az AP-Fahrwerke által gyártott állítható magasságú futóművet fel lehet szerelni a következő autótípusra:</p>\n	<ul>\n		<li>Volkswagen Passat B8 Sedan 4-Motion</li>\n		<li>Tipuskód: 3C, B8</li>\n		<li>Évjárat: 2014.11-től</li>\n		<li>Tengelyterhelés elöl (kg): 1060</li>\n		<li>Tengelyterhelés hátul (kg): 1250</li>\n		<li>Kivéve Variant\n		</li>\n		<li>Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.\n		</li>\n		<li>Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges !\n		</li>\n	</ul>\n</div>\n<div>\n	<p>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</p>\n	<ul>\n		<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható\n		</li>\n		<li>(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)\n		</li>\n		<li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +0 mm\n		</li>\n	</ul>\n</div>\n<div>\n	<p>Gyártó: AP-Fahrwerke Németország</p>\n	<ul>\n		<li>Garancia: 2 év\n		</li>\n	</ul>\n</div>', 'AP made by KW Volkswagen Passat B8 Sedan 4-Motion, 2014.11-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-sedan-4-motion-2014-11-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1528, '', '<div>\n    <p>Ez a módosítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n    <ul>\n        <li>Volkswagen Passat B8 Sedan 4-Motion</li>\n        <li>Tipuskód: 3C, B8</li>\n        <li>Évjárat: 2014.11-től</li>\n        <li>Tengelyterhelés elöl (kg): 1061-1200</li>\n        <li>Tengelyterhelés hátul (kg): 1250</li>\n        <li>Kivéve Variant\n            Az ültetés mértéke csökkenthető a gyárilag sportfutóművel rendelkező modelleknél.\n            Magnetride elektromágneses futóművel felszerelt Audi modelleknél a vezérlőegység deaktiválása szükséges!\n        </li>\n    </ul>\n    <ul>\n        <li>Ez a futómű összeállítás német nyelvű TÜV engedéllyel rendelkezik!</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható\n            (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)\n        </li>\n        <li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +0 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: Ap-Fahrwerke, Németország</li>\n        <li>Garancia időtartama: 2 év</li>\n    </ul>\n</div>', 'AP made by KW Volkswagen Passat B8 Sedan 4-Motion, 2014.11-től, (első tengely terhelés 1061-1200kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-sedan-4-motion-2014-11-tol-els-tengely-terheles-1061-1200kg-allithato-magassagu-futomu'),
(1529, '', '<div>\n    <p>Ez az állítható magasságú futómű egy olyan autótípushoz készült, mint a Volkswagen Passat B8 Sedan 4-Motion.</p>\n    <ul>\n        <li>A futómű passzol a következő típuskódú és évjáratú autókhoz: 3C, B8; 2014.11-től</li>\n        <li>A tengelyterhelés a következő: elöl 1061-1200 kg, hátul 1250 kg</li>\n        <li>A Variant modellek kivételével alkalmazható</li>\n        <li>Az ültetés csökkenthető gyárilag sportfutóművel rendelkező modelleknél</li>\n        <li>Az Audi modellek esetében, melyek Magnetride elektromágneses futóművel vannak ellátva, a vezérlőegység deaktiválása szükséges</li>\n    </ul>\n    <ul>\n        <li>A futóműszett rendelkezik Német nyelvű TÜV engedéllyel</li>\n        <li>Az engedélyben meghatározott ültetés mértéke: elöl 30-60 mm, hátul 30-60 mm között állítható (a TÜV engedély csak ezekkel az értékekkel érvényes)</li>\n        <li>Lehetséges további ültetés: elöl +5 mm, hátul +0 mm</li>\n    </ul>\n    <ul>\n        <li>Gyártó: Ap-Fahrwerke, Németországban készült</li>\n        <li>2 év garancia a termékre</li>\n    </ul>\n</div>', 'AP made by KW Volkswagen Passat B8 Variant, kivéve 4-Motion, 2014.11-től, (első tengely terhelés 1031-1200kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-variant-kiveve-4-motion-2014-11-tol-els-tengely-terheles-1031-1200kg-allithato-magassagu-futomu'),
(1530, '', '<p>Ez az állítható magasságú futómű kompatibilis a következő autótípussal:</p>\n\n<ul>\n    <li>Volkswagen Passat B8 Variant 4-Motion</li>\n    <li>Tipuskód: 3C, B8</li>\n    <li>Évjárat: 2014.11-től</li>\n    <li>Tengelyterhelés elöl (kg): 1060</li>\n    <li>Tengelyterhelés hátul (kg): 1250</li>\n    <li>Kivéve 2WD és Sedan<br />\n    Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.<br />\n    Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges!</li>\n</ul>\n\n<ul>\n    <li>Ez a futóműszett Német nyelvű TÜV engedéllyel rendelkezik!</li>\n    <li>Az engedélyben meghatározott ültetés mértéke elöl: 35-60 mm, hátul: 20-45 mm között állítható<br />\n    (Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n    <li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +0 mm</li>\n</ul>\n\n<ul>\n    <li>Made In Ap-Fahrwerke Németország</li>\n    <li>Garancia erre a termékre: 2 év</li>\n</ul>', 'AP made by KW Volkswagen Passat B8 Variant 4-Motion, 2014.11-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-variant-4-motion-2014-11-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1531, '', '<div>\n    <p>Ez a <strong>Állítható magasságú futómű</strong> kompatibilis a következő autótípussal:</p>\n    <ul>\n        <li><strong>Volkswagen Passat B8 Variant 4-Motion</strong></li>\n        <li><strong>Tipuskód:</strong> 3C, B8</li>\n        <li><strong>Évjárat:</strong> 2014.11-től</li>\n        <li><strong>Tengelyterhelés elöl (kg):</strong> 1061-1200</li>\n        <li><strong>Tengelyterhelés hátul (kg):</strong> 1250</li>\n        <li>Kivéve 2WD és Sedan</li>\n        <li>Az ültetés mértéke csökkenhet a gyárilag sportfutóművel rendelkező modelleknél.</li>\n        <li>Magnetride elektromágneses futóművel ellátott Audi modelleknél a vezérlőegység deaktiválása szükséges!</li>\n    </ul>\n    <ul>\n        <li>Ez a futóműszett <strong>Német nyelvű TÜV engedéllyel</strong> rendelkezik!</li>\n        <li>Az engedélyben meghatározott ültetés mértéke elöl: 35-60 mm, hátul: 20-45 mm között állítható</li>\n        <li>(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n        <li>Plussz ültetés lehetőség elöl: +5 mm, hátul: +0 mm</li>\n    </ul>\n    <ul>\n        <li><strong>Made In Ap-Fahrwerke Németország</strong></li>\n        <li><strong>Garancia erre a termékre:</strong> 2 év</li>\n    </ul>\n</div>', 'AP made by KW Volkswagen Passat B8 Variant 4-Motion, 2014.11-től, (első tengely terhelés 1061-1200kg) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-b8-variant-4-motion-2014-11-tol-els-tengely-terheles-1061-1200kg-allithato-magassagu-futomu'),
(1532, '', '<p><strong>Volkswagen Passat B8 Bilstein B14 állítható magasságú futómű</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat B8, </strong>1.4TSi, 1.4TSi 4-Motion, 1.4GTE Hybrid, 1.5TSi, 1.8TSi, 2.0TSi, 2.0TSi 4-Motion, 1.6TDi, 2.0TDi, 2.0TDi 4-Motion</li>\\r\\n	<li><strong>Volkswagen Passat B8 Variant, </strong>1.4TSi, 1.4TSi 4-Motion, 1.4GTE Hybrid, 1.5TSi, 1.8TSi, 2.0TSi, 2.0TSi 4-Motion, 1.6TDi, 2.0TDi, 2.0TDi 4-Motion</li>\\r\\n	<li>Kivéve DCC futóművel szerelt</li>\\r\\n	<li>Csak Multilink futóművel</li>\\r\\n	<li>55mm szárátmérő</li>\\r\\n	<li>Első tengely terhelés: 1200kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 1253kg alatt</li>\\r\\n</ul>\\r\\n\\r\\n<p><br />\\r\\nBILSTEIN egycsöves rendszer<br />\\r\\nTetején lefelé mutató technológiával<br />\\r\\nVersenysportrugók erős anyagból készültek<br />\\r\\nÁllítható magasságú (az alumíniumból készült rugótányér és kontra anya)<br />\\r\\nVersenysport technológia az utcai használatra, a B14-gyel a BILSTEIN mérnökei ezt a koncepciót valósították meg, ami jelentős előnyt nyújt. A B14 PSS-nél a jármű magassága, az első és hátsó tengelynél maximum 50 mm-rel csökkenthető egy korlátozott, 20 mm-es állítási tartományon belül. A B14 PSS rendkívül erős egycsöves tetején lefelé mutató technológiája gondoskodik minden körülmények között a kiegyensúlyozott vezetési teljesítményről és a vezetés élvezetéről.</p>\\r\\n', 'Bilstein Volkswagen Passat B8, beleértve Variant, csak Multilink futóművel szerelt, 2014.08-tól, 55mm szárátmérő, (első tengely terhelés 1200kg alatt), Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-passat-b8-beleertve-variant-csak-multilink-futomuvel-szerelt-2014-08-tol-55mm-szaratmer-els-tengely-terheles-1200kg-alatt-bilstein-b14-allithato-magassagu-futomu'),
(1533, '', '<strong>Volkswagen Passat CC Jom BlueLine állítható magasságú sportfutómû:</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A Volkswagen Passat CC modellhez elérhetőek különböző motorváltozatok, mint például a 1.4 TSI, 1.8 TSI, 2.0 TSI, 3.6 V6, 2.0 TDI, valamint a 2.0 Blue TDI</li>\\r\\n	<li>Az első tengely maximális terhelése: 1200kg alatt</li>\\r\\n	<li>A hátsó tengely maximális terhelése: 1260kg alatt</li>\\r\\n	<li>Az ültetés mértéke az első tengelynél: 20-60mm</li>\\r\\n	<li>Az ültetés mértéke a hátsó tengelynél: 30-60mm</li>\\r\\n	<li><strong>A futómű telepítéséhez ajánlott használni egy rövidített stabilizátor készletet! A készlet nem része a csomagnak. Kompatibilis termékszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>A BlueLine sportfutóművek kiemelkedő minőséget képviselnek, melyek mindegyike típusspecifikus. Az autó magassága egy meghatározott tartományon belül a speciális állítókulcs segítségével könnyedén módosítható.</p>\\r\\n\\r\\n<p>- Rendelkezik 19.3 TÜV minősítéssel<br />\\r\\n- EPS technológiával készült, porfestett és horganyzott alkatrészekkel</p>\\r\\n', 'Jom Bochum Volkswagen Passat CC, beleértve 4-Motion, 2008.06-tól, (első tengely terhelés 1200kg alatt), Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-passat-cc-beleertve-4-motion-2008-06-tol-els-tengely-terheles-1200kg-alatt-blue-line-allithato-magassagu-futomu'),
(1534, '', '<div>\\n  <div>\\n    <strong>Volkswagen Passat CC egy olyan autó, amely rendelkezik egyedi beállítható magasságú futóművel.</strong>\\n  </div>\\n</div>', 'V-Maxx Volkswagen Passat CC 4-Motion, 2.0TDi, 2.0TDi DSG, 3.2 V6, kivéve DCC-vel szerelt, 2008.06-tól, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-4-motion-2-0tdi-2-0tdi-dsg-3-2-v6-kiveve-dcc-vel-szerelt-2008-06-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1535, '', '<div>\\n<p><strong>A Volkswagen Passat CC-hoz elérhető V-Maxx állítható magasságú futómű</strong></p>\\n<p>A Volkswagen Passat CC modellhez rendelhető V-Maxx futómű lehetőséget biztosít a magasság állítására, így testre szabhatod a járműd futóművét az egyéni igényeidnek megfelelően.</p>\\n</div>', 'V-Maxx Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1536, '', '<div>\\n  A Volkswagen Passat CC modellje V-Maxx állítható magasságú futóművel van ellátva.\\n</div>', 'V-Maxx Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, 50mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-50mm-szaratmer-allithato-magassagu-futomu'),
(1537, '', '<div>\\nA Volkswagen Passat CC számára fejlesztett V-Maxx futómű egy olyan technológia, amely lehetővé teszi a jármű alvázának magasságának módosítását.\\n</div>', 'V-Maxx Volkswagen Passat CC 4-Motion, 2.0TDi, 2.0TDi DSG, 3.2 V6, kivéve DCC-vel szerelt, 2008.06-tól, 55mm szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-4-motion-2-0tdi-2-0tdi-dsg-3-2-v6-kiveve-dcc-vel-szerelt-2008-06-tol-55mm-szaratmer-allithato-magassagu-futomu'),
(1538, '', '<p><strong>Állítható magasságú sport futómű a Volkswagen Passat B7 MTS-Technik Street Series számára</strong></p>\\r\\n\\r\\n<p><u>A következő modellekhez:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Sedan,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Variant,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li>Első tengely terhelés: 1100-1180 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1230 kg alatt</li>\\r\\n	<li>Ültetés mértéke elöl: 35-70 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-60 mm</li>\\r\\n	<li><strong>A futómű beszereléséhez rövidített stabilizátor szett használata ajánlott! A szett NEM tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművek ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár! A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik futóművei optimalizált egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>a termék rendelkezik TÜV engedéllyel!</strong></li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>kiemelkedő hatékonyság extrém terhelés mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>ideális egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Passat CC, 2008.06-tól, (első tengely terhelés 1110-1170kg)  állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-passat-cc-2008-06-tol-els-tengely-terheles-1110-1170kg--allithato-magassagu-futomu'),
(1539, '', '<strong>Új lehetőség a Volkswagen Passat CC futóművének egyedi beállítására</strong><br />Kizárólag olyan autókhoz, amelyek nem DCC futóművel vannak felszerelve<br /><strong>20 különböző keménységi fokozatban szabályozható</strong><br />Csak 4-Motion, 3.2 V6, 2.0TDi, 2.0TDi DSG modellekhez ajánlott<br />A szárátmérője 50 mm<br />Az elülső ültetés magassága beállítható 30-70 mm között<br />A hátsó ültetés magassága beállítható 45-70 mm között<br />Ez a termék rendelkezik TÜV engedéllyel!', 'V-Maxx Volkswagen Passat CC 4-Motion, 2.0TDi, 2.0TDi DSG, 3.2 V6, kivéve DCC-vel szerelt, 2008.06-tól, 50mm szárátmérő, állítható keménységű  állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-4-motion-2-0tdi-2-0tdi-dsg-3-2-v6-kiveve-dcc-vel-szerelt-2008-06-tol-50mm-szaratmer-allithato-kemenysegu--allithato-magassagu-futomu'),
(1540, '', '<strong>Állítható magasságú V-Maxx futómű a Volkswagen Passat CC autókhoz</strong><br />Kivételt képeznek a DCC futóművel felszerelt verziók.<br /><strong>Összesen 20 különböző keménységi fokozat választható!</strong><br />A szárátmérő 55 mm.<br />Az elülső ültetési tartomány 30 - 70 mm között van.<br />A hátsó ültetési tartomány 45 - 70 mm között mozog.<br />Ez a termék rendelkezik TÜV engedéllyel!', 'V-Maxx Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, 55mm szárátmérő, állítható keménységű  állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-55mm-szaratmer-allithato-kemenysegu--allithato-magassagu-futomu'),
(1541, '', '<strong>Volkswagen Passat CC V-Maxx állítható magasságú futómű</strong><br />Kivéve: DCC futóművel felszerelt változatok<br /><strong>20 fokozatban állítható keménységű!</strong><br />Szárátmérő: 50 mm<br />Ültetés mértéke elöl: 30 - 70 mm<br />Ültetés mértéke hátul: 45 - 70 mm<br />Ez a termék TÜV engedéllyel rendelkezik!', 'V-Maxx Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, 50mm szárátmérő, állítható keménységű  állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-50mm-szaratmer-allithato-kemenysegu--allithato-magassagu-futomu'),
(1542, '', '<strong>A Volkswagen Passat CC-hez szabályozható magasságú futómű az V-Maxx-tól</strong><br />Kizárólag DCC futómű nélkül működik<br /><strong>Lehetőség van 20 eltérő keménységi szint beállítására!</strong><br />Csak kompatibilis a 4-Motion, 3.2 V6, 2.0TDi és 2.0TDi DSG modellekkel<br />A szár átmérője: 55 mm<br />Elülső ülésmagasság csökkentési tartománya: 30 - 70 mm<br />Hátsó ülésmagasság csökkentési tartománya: 45 - 70 mm<br />A termék rendelkezik TÜV jóváhagyással', 'V-Maxx Volkswagen Passat CC 4-Motion, 2.0TDi, 2.0TDi DSG, 3.2 V6, kivéve DCC-vel szerelt, 2008.06-tól, 55mm szárátmérő, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-passat-cc-4-motion-2-0tdi-2-0tdi-dsg-3-2-v6-kiveve-dcc-vel-szerelt-2008-06-tol-55mm-szaratmer-allithato-kemenysegu-allithato-magassagu-futomu'),
(1543, '', '<div><strong>Volkswagen Passat CC AP made by KW állítható magasságú sport futómû</strong>\\r\\n<p><u>A következõ típusokhoz: </u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat CC,</strong> 1.4TSi, 1.8TSi, 2.0TSi, 2.0TDi, 3.6 FSi 4motion, 2.0TDi 4motion </li>\\r\\n	<li>Elsõ tengely terhelés: 1170 kg alatt</li>\\r\\n	<li>Hátsó tengely terhelés: 1110 kg alatt</li>\\r\\n	<li>Ültetés mértéke elõl: 15-50 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 15-45 mm</li>\\r\\n	<li>(Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\\r\\n	<li>Szárátmérõ: 55mm<br />\\r\\n	Adaptiv futómûvel (DCC) szerelt jármûveknél az elektronikus vezérlõ deaktiválása (cancell kit használata) szükséges!</li>\\r\\n	<li>Figyelem! A beszereléshez állítható hosszúságú stabilizátor szett (kutyacsont) ajánlott! A szett NEM tartalmazza!</li>\\r\\n</ul>\\r\\n</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az AP futómű lehetőséget kínál a sportos autósoknak, hogy pontosan beállítsák a kívánt ültetést. A sportos vezetési élményt kombinálja a precíz ültetéssel, biztosítva a kiváló irányíthatóságot és vezetési stabilitást.</div>\\r\\n\\r\\n<div>Egy alumínium rugótányér segítségével könnyedén beállítható a jármű magassága a TÜV által engedélyezett tartományon belül. Az optimális sportosság, kényelem és biztonság egyensúlyban van a megfelelő beállítással.</div>\\r\\n\\r\\n<ul>\\r\\n	<li>kiváló minőségű termék megfizethető áron</li>\\r\\n	<li>egyéni magasságbeállítás a TÜV által engedélyezett határokon belül</li>\\r\\n	<li>magas minőségű alkatrészek és TÜV tanúsítvány</li>\\r\\n	<li>kiváló ár-érték arány</li>\\r\\n	<li>német minőség</li>\\r\\n</ul>\\r\\n', 'AP made by KW Volkswagen Passat CC, 2008.06-tól, (első tengely terhelés 1170kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-passat-cc-2008-06-tol-els-tengely-terheles-1170kg-alatt-allithato-magassagu-futomu'),
(1544, '', '<div><strong>Voltswagen Passat CC Vogtland állítható magasságú futómű</strong></div>\n<div> </div>\n<div>Kizárólag nem DCC futóművel rendelkező járművekhez</div>\n<div>Első tengely teherbírása: kevesebb, mint 1110 kg</div>\n<div> </div>\n<div>Elülső ülésmagasság állítási tartomány: 10 - 50 mm</div>\n<div>Hátsó ülésmagasság állítási tartomány: 15 - 45 mm</div>\n<div> </div>\n<div>A termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1545, '', '<div><strong>Volkswagen Passat CC Vogtland állítható magasságú futómű</strong></div> <div> </div> <div>Kizárólag nem DCC futóművel ellátott járművekhez ajánlott</div> <div>Első tengely terhelés: 1110 kg felett</div> <div> </div> <div>Elülső ültetés mértéke: 10 - 50 mm</div> <div>Hátsó ültetés mértéke: 15 - 45 mm</div> <div> </div> <div>A termék rendelkezik TÜV engedéllyel!</div>', 'Vogtland Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, (első tengely terhelés 1110kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-els-tengely-terheles-1110kg-folott-allithato-magassagu-futomu'),
(1546, '', '<p><strong>Vogtland</strong> által készített állítható magasságú futómű szett, mely passzol a Volkswagen Passat típusokhoz.</p> <ul> 	<li><strong>Évjárat</strong>: 2008-tól</li> 	<li><strong>Ültetés mértéke:</strong> 10 - 50 / 15 - 45 mm</li> 	<li><strong>Típus</strong>: Volkswagen Passat CC, Typ 3CC, 2WD, 4WD, első tengely terhelése legfeljebb 1110 kg, DDC futóművel szerelt típusokhoz (a DDC deaktiváló szettet a csomag tartalmazza!)</li> 	<li><strong>Max. tengelyterhelés elöl</strong>: (legfeljebb) 1110 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 1020 kg</li> 	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF28-29_1547-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW800GF28-29_1547-10.pdf</a></li> </ul> <p>Ez a futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanem maximális vezetési élményt is biztosít. Az ültetés magasságát az egyéni igényeknek megfelelően lehet beállítani. A futómű tartalmaz kétcsöves lengéscsillapítókat, melyek alacsony nyomású gázrendszerrel rendelkeznek, ezzel biztosítva a kiegyensúlyozott komfortos és dinamikus vezetést. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, és 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra.</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak ellátva.</p> <p>Made in Germany!</p> <p>Cikkszám: 968285</p>', 'Vogtland Volkswagen Passat CC, csak DCC-vel szerelt, 2008.06-tól, (első tengely terhelés 1110kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-passat-cc-csak-dcc-vel-szerelt-2008-06-tol-els-tengely-terheles-1110kg-alatt-allithato-magassagu-futomu'),
(1547, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN PASSAT</p> <ul> <li><strong>Évjárat</strong>: 2008-tól</li> <li><strong>Ültetés mértéke:</strong> 10 - 50 / 15 - 45 mm</li> <li><strong>Típus</strong>: Volkswagen Passat CC, Typ 3CC, 2WD, 4WD, az első tengely terhelése több mint 1110 kg, DDC futóművel szerelt típusokhoz <strong>(DDC kiiktatása szükséges, a DDC deaktiváló szettet a csomag tartalmazza!)</strong></li> <li><strong>Max. tengelyterhelés elöl</strong>: 1111-1160 kg</li> <li><strong>Max. tengelyterhelés hátul</strong>: 1020 kg</li> <li><strong>Engedély</strong>: <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF28-29_1547-10.pdf\\\" target=\\\"_blank\\\">ga7-172098-Vogtland-GFW800GF28-29_1547-10.pdf</a></li> </ul> <p>Az autó megjelenésének javítása mellett optimális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerének köszönhetően biztosítják a kiegyensúlyozott kényelmet és a fokozott dinamizmust. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p> <p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p> <p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezővel vagy torziós futóművel vannak ellátva.</p> <p>Németországban készült!</p> <p>Cikkszám: 968286</p>', 'Vogtland  Volkswagen Passat CC, csak DCC-vel szerelt, 2008.06-tól, (első tengely terhelés 1110kg fölött) állítható magasságú futómű', '', '', '', 'vogtland--volkswagen-passat-cc-csak-dcc-vel-szerelt-2008-06-tol-els-tengely-terheles-1110kg-folott-allithato-magassagu-futomu'),
(1548, '', '<div><strong><span>Audi A3 (8P model) Bilstein B14 Adjustable Suspension</span></strong><br />\\r\\n<br />\\r\\n<span>BILSTEIN single-tube system</span><br />\\r\\n<span>Utilizing Upside-Down technology</span><br />\\r\\n<span>High-strength competition springs</span><br />\\r\\n<span>Adjustable height (spring perch and lock nut made of aluminum)</span><br />\\r\\n<span>Bringing racing technology to the streets, the B14 by BILSTEIN engineers embodies this concept, providing a significant advantage. With the B14 PSS, the vehicle height can be lowered by up to 50 mm on the front and rear axles within a defined 20mm adjustment range. The extreme-duty single-tube Upside-Down technology of the B14 PSS ensures balanced handling performance and driving pleasure in all situations.</span></div>\\r\\n', 'Bilstein Volkswagen Passat CC, kivéve DCC-vel szerelt, 2008.06-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-passat-cc-kiveve-dcc-vel-szerelt-2008-06-tol-bilstein-b14-allithato-magassagu-futomu'),
(1549, '', '<div>Egy JOM BlueLine Állítható magasságú futómű szett érhető el a következő autótípushoz:</div>\n<div>A futómű illeszkedik a Volkswagen Polo modellekhez, különböző motorváltozatokkal és évjárattól függően.</div>\n<div>A futóműnek van egy Tipuskódja: AW, és az évjárata 2017.06-tól kezdődik.</div>\n<div>A futóműszett rendelkezik német nyelvű TÜV engedéllyel, amely garantálja az előírt ültetési beállításokat.</div>\n<div>Az ültetés mértéke elöl 30-60mm között, hátul szintén 30-60mm között állítható, bár gyakran nagyobb intervallumban is.</div>\n<div>A futómű Németországban gyártott, és a cikkszáma: 741212.</div>\n<div>A futóműszett ára vonatkozik az egész szettre.</div>\n<div>A JOM Blueline futóműszett magas minőségű, autóspecifikus alkatrészekből áll.</div>\n<div>A magasságbeállítás testreszabható az egyéni igények szerint a megadott paraméterek között.</div>\n<div>A futómű teljes beállítási tartományában azonos rugókeménység és csillapítás érvényes.</div>\n<div>A futómű kiváló kanyarstabilitást nyújt, mivel ellenáll a keresztirányú erőknek.</div>', 'Jom Bochum Volkswagen Polo 6 (Typ: AW), 2017.06-tól állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-polo-6-typ-aw-2017-06-tol-allithato-magassagu-futomu'),
(1550, '', '<p>A Volkswagen Polo 6 Street Series MTS-Technik állítható magasságú sport futóműve ideális választás azok számára, akik számára fontos a kiváló minőség és az elérhető ár. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy az autó hasmagassága könnyedén igazítható legyen az útviszonyokhoz. Az MTS-Technik futóműveinek rugói az Eibach által gyártottak, és a magasság szabadon állítható általában 25 és 80 mm között. A futómű gáztöltésű lengéscsillapítókkal rendelkezik, és magas hatékonyságot biztosít extrém igénybevétel mellett is. A két rétegű bevonatnak köszönhetően hosszú távú korrózióvédelem biztosított. Az összhang a rugók és a lengéscsillapítók között tökéletes, és a készlet könnyen telepíthető, módosítás nélkül az autó felfüggesztésében.</p>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 6 (Typ: AW), beleértve GTi, 2017.06-tól, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6-typ-aw-beleertve-gti-2017-06-tol-street-series-allithato-magassagu-futomu'),
(1551, '', '<strong>Volkswagen Polo 6 V-Maxx állítható magasságú sport futómű</strong><br /><ul><br /><li>A Volkswagen Polo 6 számos változatához kompatibilis, például 1.0, 1.0MPI, 1.0TGI, 1.0TSI, 1.5TSI, 2.0GTI és 1.6TDI kivitelekhez ajánlott</li><br /><li>A futómű típusa: AW</li><br /><li>Az ültetés mértéke elöl: 40 - 70 mm</li><br /><li>Az ültetés mértéke hátul: 40 - 70 mm</li><br /><li>A futómű beépítéséhez rövidített stabilizátorrúd szükséges, mely nem tartozék</li><br /><li>A termék rendelkezik TÜV engedéllyel</li><br /><li>24 hónap garanciával</li><br /></ul><br /><p><em>A weblap tartalmának és képeinek jogtalan másolása és sokszorosítása tilos!</em></p>', 'V-Maxx Volkswagen Polo 6 (Typ: AW), beleértve GTi, 2017.06-tól állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-6-typ-aw-beleertve-gti-2017-06-tol-allithato-magassagu-futomu'),
(1552, '', '<p><strong>Volkswagen Polo 6 Comfort Series MTS-Technik állítható magasságú sport futómű</strong></p>\n<ul>\n	<li><strong>Volkswagen Polo 6 (Typ: AW, BZ),</strong> 1.0 / 1.0MPi / 1.0TGI / 1.0TSI / 1.5TSI / 2.0GTI / 1.6TDI</li>\n	<li>Ültetés mértéke elöl: 25-55mm</li>\n	<li>Ültetés mértéke hátul: 25-50mm</li>\n	<li>Első tengely terhelés: 1010kg</li>\n	<li>Hátsó tengely terhelés: 930kg</li>\n	<li>A termék TÜV engedéllyel rendelkezik!</li>\n</ul>\n<p>Az <strong>MTS-Technik Comfort Series állítható magasságú sport futóművei</strong> ideális választás azoknak, akik az autójuk sportos megjelenése mellett fontosnak tartják az utazási kényelmet is. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az <strong>MTS-Technik Comfort futóművei</strong> maximális komfortot biztosítanak, mivel tökéletes összhangban vannak az <strong>Eibach rugókkal</strong> és az <strong>MTS-Technik lengéscsillapítókkal</strong>.</p>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>a <strong>Comfort Series</strong> megalkotásakor hangsúlyt fektettek a magas kényelemre, nem az extrém ültetésre</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 6 (Typ: AW), beleértve GTi, 2017.06-tól, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6-typ-aw-beleertve-gti-2017-06-tol-comfort-series-allithato-magassagu-futomu'),
(1553, '', '<p><strong>Állítható magasságú sport futómű a Volkswagen Polo 6 Sport Series MTS-Techniktől</strong></p>  \n<ul>  \n	<li><strong>Volkswagen Polo 6 (Typ: AW, BZ),</strong> 1.0 / 1.0MPi / 1.0TGI / 1.0TSI / 1.5TSI / 2.0GTI / 1.6TDI</li>  \n	<li>Ültetés mértéke elõl: 25-55mm</li>  \n	<li>Ültetés mértéke hátul: 25-50mm</li>  \n	<li>Elsõ tengely terhelés: 1010kg</li>  \n	<li>Hátsó tengely terhelés: 930kg</li>  \n	<li>A termék TÜV engedéllyel rendelkezik!</li> \n</ul>  \n<p>Az <strong>MTS-Technik Sport Series állítható magasságú sport futómű</strong> a választás azok számára, akik nem szeretnének kompromisszumot kötni. A fokozatmentesen állítható magasság lehetővé teszi, hogy az autó hasmagassága könnyedén alkalmazkodjon az útviszonyokhoz. Az <strong>MTS-Technik Sport állítható futóművei</strong> optimális összhangban vannak az <strong>Eibach</strong> rugókkal és az <strong>MTS-Technik lengéscsillapítókkal</strong>, biztosítva ezzel a maximális vezetési élményt és széles ültetési tartományt.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>  \n	<li>speciális <strong>Eibach rugók</strong> a maximális sportosság érdekében</li>  \n	<li>a <strong>Sport Series</strong> létrehozása során a szélesebb ültetési tartomány mellett a fokozott vezetési élmény elérése volt a cél</li>  \n	<li>gáztöltetű lengéscsillapítók</li>  \n	<li>magas hatékonyság extrém igénybevétel mellett is</li>  \n	<li>két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>  \n	<li>tökéletes összhang rugó és lengéscsillapító között</li>  \n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> \n</ul>  \n<p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></p>  \n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Volkswagen Polo 6 (Typ: AW), beleértve GTi, 2017.06-tól, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6-typ-aw-beleertve-gti-2017-06-tol-sport-series-allithato-magassagu-futomu'),
(1554, '', '<strong>Állítható magasságú sport futómű a Volkswagen Polo 6-hoz</strong><br /><ul><br /><li>A Volkswagen Polo 6 különböző motorváltozataihoz tervezve</li><br /><li>Megfelelő típus: AW</li><br /><li>Elülső ültetés mértéke: 40 - 70 mm</li><br /><li>Hátsó ültetés mértéke: 40 - 70 mm</li><br /><li>Keménység 20 különböző fokozatban állítható</li><br /><li>A beépítéshez rövidített stabilizátorrúd szükséges, amely nem tartozék</li><br /><li>A futómű rendelkezik TÜV engedéllyel</li><br /><li>Garancia időtartama: 24 hónap</li><br /></ul><br /><p><em>A weboldal szöveges és vizuális tartalmának jogosulatlan másolása tilos!</em></p>', 'V-Maxx Volkswagen Polo 6 (Typ: AW), beleértve GTi, 2017.06-tól, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-6-typ-aw-beleertve-gti-2017-06-tol-allithato-kemenysegu-allithato-magassagu-futomu'),
(1555, '', '<p>A Volkswagen Polo 6N JOM BLUE LINE állítható futómű egy kiváló minőségű alkatrész, melyet Németországban gyártottak. Az évjárata 1994.09 és 1999.09 közötti időszakra esik, és a Typ.: 6N típushoz készült. Az elülső tengelyterhelése 865 kg, míg a hátsó tengelyé 820 kg. Ennek a futóműnek a csomagolása tartalmazza a német nyelvű TÜV engedélyt. Emellett 2 év teljeskörű garanciával rendelkezik. Az ültetés mértéke -4 cm és -12 cm között állítható egy állítókulcs segítségével. A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint az állításhoz szükséges 1 db kulcsot.</p>', 'Jom Bochum Volkswagen Polo 6N, 1994.09-1999.09-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-polo-6n-1994-09-1999-09-ig-blue-line-allithato-magassagu-futomu'),
(1556, '', '</div>\\n<div>\\n<p>Egy olyan futóművet kínálunk, amely lehetővé teszi a Volkswagen Polo 6N járművek magasságának állítását. Ez a V-Maxx futómű segít abban, hogy testre szabott vezetési élményt nyújtson az autóvezetők számára. A futómű beállítása egyszerű és hatékony, így könnyedén alkalmazkodhat az egyéni igényekhez és körülményekhez.</p>\\n</div>', 'V-Maxx Volkswagen Polo 6N, 1994.09-1999.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-6n-1994-09-1999-09-ig-allithato-magassagu-futomu'),
(1557, '', '<p>A <strong>Volkswagen Polo 6N MTS-Technik Sport Series állítható magasságú sport futómű</strong> tökéletes választás a vezetés szerelmeseinek, akik nem akarnak kompromisszumot kötni. Az útviszonyokhoz rugalmasan alkalmazkodó magasságállítás lehetővé teszi az autó hasmagasságának könnyed beállítását. Az <strong>MTS-Technik Sport állítható futóművei</strong> ideális egyensúlyt teremtenek az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az <strong>Eibach</strong> gyártja, hogy maximális sportosságot biztosítson.</li>\n	<li>A <strong>Sport Series</strong> létrehozása során a széles ültetési tartomány és a fokozott vezetési élmény volt a fő szempont.</li>\n	<li>Gáztöltésű lengéscsillapítók a magas hatékonyság érdekében extrém körülmények között is.</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében.</li>\n	<li>A rugó és lengéscsillapító tökéletes összhangja.</li>\n	<li>A készlet könnyen telepíthető, nem igényel felfüggesztési módosításokat.</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 6N, beleértve Classic és Kombi, 1994.09-1999.09-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6n-beleertve-classic-es-kombi-1994-09-1999-09-ig-sport-series-allithato-magassagu-futomu'),
(1558, '', '<strong>Volkswagen Polo 6N MTS-Technik Street Series állítható magasságú sport futómű</strong><br /><ul> <li>Volkswagen Polo 6N, 1.0 / 1.3 / 1.4 / 1.4 16V / 1.6 / 1.6 16V GTI / 1.7SDI / 1.9D / 1.9SDI</li> <li>Volkswagen Polo Classic, 1.4 / 1.4 16V / 1.6 / 1.8 / 1.7SDI / 1.9SDI / 1.9TDI</li> <li>Volkswagen Polo 6N Variant, 1.4 / 1.4 16V / 1.6 / 1.8 / 1.7SDI / 1.9SDI / 1.9TDI</li> <li>Ültetés mértéke elõl: 20-90mm</li> <li>Ültetés mértéke hátul: 20-80mm</li> <li>Elsõ tengely terhelés: 900kg</li> <li>Hátsó tengely terhelés: 810kg</li> <li>Tüv engedélyezése folyamatban</li> </ul><br /><p>A MTS-Technik állítható magasságú sport futóművei kitűnő minőségben és megfizethető áron állnak rendelkezésre az autótulajdonosok számára. A futóművek magassága folyamatosan állítható, így könnyen alkalmazkodik az adott útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlyban vannak.</p><br /><p><u>Termékjellemzők:</u></p> <br /><ul> <li>az állítható magasságú futóművek rugóit általában az Eibach gyártja</li> <li>a magasság széles skálán szabadon állítható, általában 25 és 80 mm között</li> <li>gáztöltésű lengéscsillapítók</li> <li>kiemelkedő hatékonyság extrém igénybevétel esetén</li> <li>két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li> <li>optimális egyensúly a rugók és a lengéscsillapítók között</li> <li>a készlet \"plug & play\", nem igényel módosítást az autó felfüggesztésén</li> </ul> <br /><p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" style=\"height:314px; width:400px\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 6N, beleértve Classic és Kombi, 1994.09-1999.09-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6n-beleertve-classic-es-kombi-1994-09-1999-09-ig-street-series-allithato-magassagu-futomu'),
(1559, '', '<div><strong>Állítható magasságú sport futómű a Volkswagen Polo 6N-hoz</strong></div> <div><span>Az AP futómű lehetőséget biztosít a vezető számára, hogy pontosan beállítsa az általa kívánt ültetést. Ez a futómű kombinálja a sportos irányíthatóságot és az optimális vezetési viselkedést, maximális ültetéssel.</span></div> <div><span>Egy alumínium rugótányér segítségével a járműmagasságot a TÜV által engedélyezett tartományban egyénileg be lehet állítani. Ennek eredményeként a sportosság, kényelem és biztonság egyensúlyban van, ami optimális felépítést eredményez.</span></div> <ul>     <li><span>kiváló minőségű alkatrészek megfizethető áron</span></li>     <li><span>egyedi magasság beállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>minőségi alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kiváló ár-érték arány</span></li>     <li><span>német minőségű</span></li> </ul>', 'AP made by KW Volkswagen Polo 6N, 1994.08-1999.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-polo-6n-1994-08-1999-09-ig-allithato-magassagu-futomu'),
(1560, '', '<p>A <strong>Volkswagen Polo 6N MTS-Technik Comfort Series állítható magasságú sport futómű</strong> tökéletes választás azoknak, akik fontosnak tartják a sportos megjelenést és az utazási kényelmet egyaránt. A futómű könnyedén állítható a megfelelő magasságra az útviszonyoknak megfelelően. Az <strong>MTS-Technik Comfort futóművei</strong> ideális egyensúlyt teremtenek az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>A <strong>Comfort Series</strong> kialakításnál a hangsúly a magas kényelemre helyeződött</li>\n	<li>Gáztöltéses lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevételek mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 6N, beleértve Classic és Kombi, 1994.09-1999.09-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6n-beleertve-classic-es-kombi-1994-09-1999-09-ig-comfort-series-allithato-magassagu-futomu'),
(1561, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelel a Volkswagen Polo 1994-1999 évi típusú autókhoz. Ennek a futóműnek az ültetés mértéke 40-70 mm lehet mind elöl, mind hátul. A megfelelő értékek beállítása lehetővé teszi az autó megjelenésének javítását és optimális vezetési élmény biztosítását. A szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerrel rendelkeznek a kiegyensúlyozott komfort és fokozott dinamika érdekében. A lengéscsillapítók kiváló korrozó elleni védelemmel rendelkeznek.</p>\n<p>Ez a minőségi futómű szett TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. Az alapcsomag 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyek szintező vagy torziós futóművel vannak felszerelve.</p>\n<p>Az összes termék Made in Germany!</p>\n<p>Cikkszám: 968218</p>', 'Vogtland Volkswagen Polo 6N, 1996.09-1999.10-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-polo-6n-1996-09-1999-10-ig-allithato-magassagu-futomu'),
(1562, '', '<p>Egy állítható magasságú futómű kínálja a Volkswagen Polo 6N2 JOM BLUE LINE modellhez. Ez a futómű kiváló minőségű, MADE IN GERMANY. A típuskódja 6N2, és az évjárata 1999.10-től 2001.11-ig terjed. Az elülső tengelyterhelés 900 kg, míg a hátsó tengelyterhelés 770 kg. A csomag tartalmaz egy német nyelvű TÜV engedélyt, és 2 ÉV TELJESKÖRŰ GARANCIÁVAL rendelkezik. A szett magában foglal 4 lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 kulcsot az állításhoz.</p>', 'Jom Bochum Volkswagen Polo 6N2, 1999.10-2001.11-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-polo-6n2-1999-10-2001-11-ig-blue-line-allithato-magassagu-futomu'),
(1563, '', '<div><strong>Seat Ibiza V-Maxx állítható magasságú futómû</strong></div> <div>Az Ibiza V-Maxx futóművet a 6K2 típusú Seat Ibizához tervezték, és az 1999 és 2002 közötti években volt elérhető. Az ültetés mértéke elöl és hátul egyaránt 40-80 mm lehet. Fontos megjegyezni, hogy ez a termék rendelkezik TÜV engedéllyel, ami garanciát nyújt a minőségre és biztonságra.</div>', 'V-Maxx Volkswagen Polo 6N2, 1999.10-2001.11-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-6n2-1999-10-2001-11-ig-allithato-magassagu-futomu'),
(1564, '', '<strong>Állítható magasságú sport futómű</strong></p>  <p>Az állítható magasságú sport futóművek ideális választás azok számára, akik számára fontos a kiváló minőség és az megfizethető ár. Az útviszonyoknak megfelelően könnyedén beállítható az autó hasmagassága, mivel fokozatmentesen állítható magassággal rendelkeznek. Az optimális egyensúlyt a rugók és a lengéscsillapítók között biztosítják. </p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság széles tartományban szabályozható, általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Rugó és lengéscsillapító tökéletes összhangja</li> 	<li>A készlet plug & play, nem szükséges módosítás az autó felfüggesztésén</li> </ul> ', 'MTS-Technik by Nord Performance Volkswagen Polo 6N2, 1999.10-2001.11-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6n2-1999-10-2001-11-ig-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1565, '', '<div><strong><span>Volkswagen Polo 6N2 AP állítható magasságú sport futómű</span></strong></div> <div><span>Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezető számára, hogy milliméter pontosan beállítsa az általa kívánt ülésmagasságot. A sportos irányíthatóság és optimális vezetési magatartás kombinációját kínáljuk, maximalizálva ezzel az ülésmagasságot.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetséges a járműmagasság egyéni beállítása a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus egyensúlyba hozása optimális felépítést eredményez.</span></div> <ul>     <li><span>kiváló minőség megfizethető áron</span></li>     <li><span>egyéni magasság beállítás a TÜV által engedélyezett tartományban</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány<br type=\"_moz\" />     </span></li>     <li><span>egyedülálló ár/érték arány<br type=\"_moz\" />     </span></li>     <li><span>német minőség</span></li> </ul>', 'AP made by KW Volkswagen Polo 6N2, 1999.10-2001-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-polo-6n2-1999-10-2001-ig-allithato-magassagu-futomu'),
(1566, '', '<p><strong>Vogtland</strong><span> Polo 6N2 szabályozható magasságú sport futómû</span></p> <ul>     <li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li>     <li><strong>Típus</strong>: Volkswagen Polo 6N2</li>     <li><strong>Max. tengelyterhelés elõl</strong>: 900 kg</li>     <li><strong>Max. tengelyterhelés hátul</strong>: 810 kg</li> </ul> <p>Az autó megjelenésének javítása mellett kiváló vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint lehet beállítani. A futómû szett kizárólag speciális, nagy teljesítményû két csöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetõen garantálják a kiegyensúlyozott kényelmet és a dinamikus vezetést. A lengéscsillapítók kiemelkedõ korrózióvédelmet biztosítanak.</p> <p>A termék TÜV minõsítéssel rendelkezik. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetõ rugókra és a lengéscsillapítókra!</p> <p>A szett alapvetõen 4 db ültetõ rugót és 4 db lengéscsillapítót tartalmaz, kivéve azon autótípusok esetén, amelyeknél szintezõs vagy torziós futómû van szerelve.</p> <p>Németországban készült!</p> <p>Cikkszám: 968219</p>', 'Vogtland Volkswagen Polo 6N2, 1999.10-2001.11-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-polo-6n2-1999-10-2001-11-ig-allithato-magassagu-futomu'),
(1567, '', '<strong>Volkswagen Polo 6R JOM BLUE LINE állítható magasságú futómû</strong></p>\\r\\n\\r\\n<p>Típuskód: 6R</p>\\r\\n\\r\\n<p>Évjárat: 2009.06-2017</p>\\r\\n\\r\\n<p>A futómű hátsó tengelyénél a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>Kérjük, vegye figyelembe, hogy a futómű telepítéséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), amely nem része ennek a szetnek!</p>\\r\\n\\r\\n<p>Az első tengely terhelése: 960 kg</p>\\r\\n\\r\\n<p>A hátsó tengely terhelése: 840 kg</p>\\r\\n\\r\\n<p>A termék NÉMETORSZÁGBAN készült</p>\\r\\n\\r\\n<p>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, amelyet a csomagolás tartalmaz</p>\\r\\n\\r\\n<p>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</p>\\r\\n\\r\\n<p>Kiemelkedő minőség, rendkívül kedvező áron!!!</p>\\r\\n\\r\\n<p>A szett tartalma: 4 lengéscsillapító a hozzá tartozó rugókkal és egy állítókulccsal</p>\\r\\n', 'Jom Bochum Volkswagen Polo 6R, 2009.06-2017-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-polo-6r-2009-06-2017-ig-blue-line-allithato-magassagu-futomu'),
(1568, '', '<div> \\nEz a sport futómű kiváló választás azoknak, akik szeretnék testreszabni autójukat és élvezni az alacsonyabb, sportosabb vezetési élményt. A Volkswagen Polo 6R modellhez tervezett állítható magasságú futómű lehetővé teszi a felhasználóknak, hogy könnyedén beállítsák az autó magasságát az egyéni igényeiknek megfelelően. Emellett a sport futómű továbbfejlesztheti az autó kanyarodási és stabilitási tulajdonságait, ezáltal még dinamikusabbá téve a vezetési élményt. Egy ilyen futómű beépítése valódi felüdülést és izgalmasabb vezetési élményt nyújthat egy Volkswagen Polo 6R tulajdonosának.</div>', 'V-Maxx Volkswagen Polo 6R, 2009.06-2017-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-6r-2009-06-2017-ig-allithato-magassagu-futomu'),
(1569, '', '<p>Az MTS-Technik Comfort Series állítható magasságú sport futóművei ideális választás azoknak, akik kiemelten fontosnak tartják az utazási kényelmet, miközben sportos megjelenést kívánnak az autójuknak. A futómű fokozatmentesen állítható magassága könnyedén alkalmazkodik az útviszonyokhoz, így biztosítva az optimális hasmagasságot. Az Eibach gyártotta rugók és az MTS-Technik lengéscsillapítók tökéletes összhangban működnek, biztosítva a maximális komfortot.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>speciális Eibach rugók a kiváló kényelem érdekében</li>\n	<li>a Comfort Series célja nem a extrém ültetés, hanem a magas komfort biztosítása</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszú élettartamú korrózióvédelem érdekében</li>\n	<li>ideális rugó-lengéscsillapító összhang</li>\n	<li>a készlet plug & play, nem igényel autófelfüggesztés módosítást</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 6R, 2009.06-tól, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6r-2009-06-tol-comfort-series-allithato-magassagu-futomu'),
(1570, '', '<p>A MTS-Technik által kínált állítható magasságú sport futóművek ideális választást jelentenek azok számára, akik számára fontos a kiváló minőség és az versenyképes ár. Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően, mivel a magasság fokozatmentesen állítható. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Fontos tulajdonságok:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>A magasság széles skálán, általában 25 és 80 mm között állítható</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel esetén is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>A felfüggesztés plug & play kialakítású, módosítás nélkül telepíthető</li> </ul>', 'MTS-Technik by Nord Performance Volkswagen Polo 6R, 2009.06-tól állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-6r-2009-06-tol-allithato-magassagu-futomu'),
(1571, '', '<div><span>Az Ap futómű megoldást nyújt a sportosan ambiciózus vezetőknek arra, hogy a kívánt ültetést milliméterre pontosan beállíthassák. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját kínáljuk, maximalizálva ezzel az ültetést.</span></div> <div><span>Alumínium rugótányér segítségével a jármű magasságát egyénileg be lehet állítani a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést biztosít.</span></div> <ul>     <li><span>kiváló minőség elérhető áron</span></li>     <li><span>egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kiemelkedő ár-érték arány</span></li>     <li><span>német minőségű</span></li> </ul>', 'AP made by KW Volkswagen Polo 6R, 2009.05-től, (első tengely terhelés 861-960kg-ig) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-polo-6r-2009-05-tol-els-tengely-terheles-861-960kg-ig-allithato-magassagu-futomu'),
(1572, '', '<strong>Állítható magasságú és keménységű futómű a Volkswagen Polo 6R modellekhez</strong><br /> <ul> <li>Autó típusa: Volkswagen Polo 6R</li> <li>Gyártás éve: 2009.06-2017</li> <li>Motorválaszték: 1.0 / 1.0TSI / 1.2 / 1.2TSI / 1.4 / 1.4TSI / 1.6 / 1.8TSI / 1.4 TDi / 1.6TDi / 1.9TDi / 2.0 TDi</li> <li>Nem kompatibilis 4-Motion változattal</li> <li>Keménység 20 fokozatban állítható</li> <li>Rövidített stabilizátorrúd szükséges a beépítéshez (nem tartalmazza az ár)</li> <li>Elülső ültetés mértéke: 35-70mm</li> <li>Hátsó ültetés mértéke: 30-50mm</li> <li>24 hónap garancia</li> <li>TÜV engedéllyel rendelkező termék</li> </ul><br /> <p>Szerelési útmutató: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/100.pdf</a></p><br /> <p>TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf\\\">https://www.v-maxx.com/files/TUV/70%20VS%2013.pdf</a></p>', 'V-Maxx  Volkswagen Polo 6R, 2009.06-2017-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx--volkswagen-polo-6r-2009-06-2017-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1573, '', '<div>\n<div>Az Ap futómű lehetőséget kínál a sportosan ambiciózus vezetők számára, hogy milliméterre precízen beállítsák a kívánt üléspozíciót. A sportos irányíthatóságot és optimális vezetési tulajdonságokat maximalizálva.</div>\n\n<div>Egy alumínium rugótányér segítségével a jármű magasságát egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság tökéletes egyensúlyát teremtve.</div>\n\n<ul>\n    <li>kiváló minőség elérhető áron</li>\n    <li>egyéni magasságbeállítás a TÜV által engedélyezett tartományon belül</li>\n    <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n    <li>kivételes ár-érték arány</li>\n    <li>német minőség</li>\n</ul>\n</div>', 'AP made by KW Volkswagen Polo 6R, 2009.05-től, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-polo-6r-2009-05-tol-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(1574, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN POLO 6R</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2009.05-tõl</li>\n	<li><strong>Ültetés mértéke:</strong> 30 - 60 / 25 - 50 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Polo, Typ 6R</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 860 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 820 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett a futómű szett maximális vezetési élményt garantál. Az ültetés mértékét saját elképzelése szerint állíthatja be az ideális értékek között. Ez a kiváló minőségű futómű szett kizárólag speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel vannak ellátva első osztályú minőségben.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A futómű szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyekhez szintező- vagy torziós futóművet szereltek fel.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968089</p>', 'Vogtland Volkswagen Polo 6R, kivéve SportSelect, 2009.05-től, (első tengely terhelés 860kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-polo-6r-kiveve-sportselect-2009-05-tol-els-tengely-terheles-860kg-alatt-allithato-magassagu-futomu'),
(1575, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN POLO 6R</p>  <ul> 	<li><strong>Évjárat</strong>: 2009.05-tõl</li> 	<li><strong>Ültetés mértéke:</strong> 30 - 60 / 25 - 50 mm</li> 	<li><strong>Típus</strong>: Volkswagen Polo, Typ 6R</li> 	<li><strong>Max. tengelyterhelés elõl</strong>: 960 kg</li> 	<li><strong>Max. tengelyterhelés hátul</strong>: 820 kg</li> </ul>  <p>Az autó megjelenését javító Vogtland futómű szett nem csupán esztétikai, hanem vezetési élményt is nyújt. A rugós-lengéscsillapítós rendszer lehetővé teszi az ültetés mértékének testreszabását az egyéni igények szerint. A kétcsöves lengéscsillapítók alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortérzetet és dinamikus vezetési élményt. Emellett kiváló korrózió elleni védelemmel rendelkeznek.</p>  <p>A futómű TÜV minősítéssel rendelkezik, és a gyártó 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>  <p>Gyártva Németországban!</p>  <p>Cikkszám: 968090</p>  ', 'Vogtland Volkswagen Polo 6R, kivéve SportSelect, 2009.05-től, (első tengely terhelés 860kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-polo-6r-kiveve-sportselect-2009-05-tol-els-tengely-terheles-860kg-folott-allithato-magassagu-futomu'),
(1576, '', '<p><strong>Állítható magasságú tuning sport futómű</strong></p>  <p>Eibach Pro-Street S néven ismert</p>  <p>Volkswagen Polo 6R modellekhez készült</p>  <p>Első tengely terhelése: 860kg alatt</p>  <p>Motorsport tapasztalatok átültetve az utcai használatba:<br /> Az Eibach Pro-Street-S futómű a motorsportban szerzett tapasztalatokra építve készült, hogy a versenypályáról az utcára is átültethető legyen.<br /> Legyen szó hétvégi versenyzésről vagy hétköznapi utazásról, a Pro-Street-S biztosítja a legjobb megoldást.<br /> A lengéscsillapítók nemesacélból készülnek, hogy garantálják a sportos megjelenést és a kiváló minőséget.<br /> A rugótányérok polyamidból készülnek a korrózióállóság érdekében.<br /> A fejlesztések és a minőségi anyaghasználat együttesen biztosítják a Pro-Street-S prémium minőségét.<br /> <br /> Tapasztalja meg az új sportos érzést:<br /> - Progresszív jelleg: motorsport technológia az utcai használatra<br /> - Sportos kényelem normál használat során, megfelelő keménység extrém körülmények között<br /> - Egyedileg állítható járműmagasság<br /> - Rozsdamentes nemesacél kivitel<br /> - Speciális kulccsal történő magasságállítás polyamid rugótányér csavarásával<br /> <br /> <u>Termékjellemzők:</u><br /> - 20-70 mm között állítható magasság<br /> - TÜV által ellenőrzött állíthatóság és teljes dokumentáció a könnyű kezelés érdekében<br /> - Rugók az ERS versenyprogramból, melyeket a rally világbajnokságon használnak<br /> - Csúcsminőségű lengéscsillapítók az Eibach előírásainak megfelelően<br /> - DIN ISO/TS 16949</p>', 'Eibach Volkswagen Polo 6R, 2009.05-től, (első tengely terhelés 860kg alatt), Pro-Street-S állítható magasságú futómű', '', '', '', 'eibach-volkswagen-polo-6r-2009-05-tol-els-tengely-terheles-860kg-alatt-pro-street-s-allithato-magassagu-futomu'),
(1577, '', '<p>Az Eibach Pro-Street S egy állítható magasságú tuning sport futómű, amelyet a Volkswagen Polo 6R modellekhez terveztek, többféle motorváltozattal. Ez a futómű kiváló választás lehet, ha szeretnéd autód teljesítményét sportosabbá tenni mind a versenypályán, mind a mindennapi közlekedés során. Az Eibach Pro-Street S lengéscsillapítói nemesacél technológiával készülnek, hogy a legmagasabb minőséget biztosítsák. A rugótányérok polyamidból készülnek a korrózióállóság érdekében. Ez a futómű lehetővé teszi az egyedi magasságállítást, és garantálja a csúcsminőségű teljesítményt. Tapasztald meg az új sportos érzést ezzel a termékkel!</p>\n\n<u>Termékjellemzők:</u>\n- Magasságállítás 20-70 mm között\n- TÜV által ellenőrzött állíthatóság és komplett dokumentáció\n- Rugók az ERS versenyprogramból\n- Csúcsminőségű lengéscsillapítók\n- DIN ISO/TS 16949', 'Eibach Volkswagen Polo 6R, 2009.05-től, (első tengely terhelés 861-960kg), Pro-Street-S állítható magasságú futómű', '', '', '', 'eibach-volkswagen-polo-6r-2009-05-tol-els-tengely-terheles-861-960kg-pro-street-s-allithato-magassagu-futomu'),
(1578, '', '<div><strong>Volkswagen Polo 6R Bilstein B14 állítható magasságú sport futómű</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A felsorolt típusokhoz: 1.2, 1.2 TDI, 1.2 TSI, 1.4, 1.4 BiFuel, 1.4 GTi, 1.4 TSI, 1.6, 1.6 BiFuel, 1.6 TDI</div>\\r\\n\\r\\n<div>Elülső ültetés: 30 - 45 mm</div>\\r\\n\\r\\n<div>Hátsó ültetés: 30 - 45 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Elülső tengely terhelhetősége: 960 kg alatt</div>\\r\\n\\r\\n<div>Hátsó tengely terhelhetősége: 800 kg alatt</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>A futómű megfelel a TÜV előírásainak!</div>\\r\\n', 'Bilstein Volkswagen Polo 6R, 2009.06-tól, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-polo-6r-2009-06-tol-bilstein-b14-allithato-magassagu-futomu'),
(1579, '', '<div><p><strong>Volkswagen Polo 6R Bilstein B16 PSS9 állítható magasságú és keménységű sport futómű</strong></p>  <p>Az alábbi típusokhoz: 1.2, 1.2 TDI, 1.2 TSI, 1.4, 1.4 BiFuel, 1.4 GTi, 1.4 TSI, 1.6, 1.6 BiFuel, 1.6 TDI</p>  <p>Elülső ültetés mértéke: 30 - 45 mm</p>  <p>Hátsó ültetés mértéke: 30 - 45 mm</p>  <p>Első tengely terhelés: 960 kg alatt</p>  <p>Hátsó tengely terhelés: 800 kg alatt</p>  <p>A futómű rendelkezik TÜV engedéllyel!</p>  <p> </p>  <p><strong>BILSTEIN B16 PSS9</strong></p>  <p>-Az egyedülálló Bilstein rendszer</p>  <p>-Fordított technológia</p>  <p-A versenysport rugók kiváló minőségű anyagokból készülnek</p>  <p>-Állítható magasság</p>  <p>-Az alumíniumból készült rugótányér és kontraanya</p>  <p>-A húzó- és nyomófokozat 9 állítható fokozatban</p>  <p>A Bilstein mérnökei által kifejlesztett futómű egy új kategóriát képvisel! A B16 PSS9 lengéscsillapítóval a jármű magassága, mind az első, mind a hátsó tengelyen akár 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. A beépített állapotban egy beállító kerék segítségével 9 különböző karakterisztika közül választhat. Ez a technológia biztosítja a jármű professzionális beállítását minden körülmények között.</p> </div>  <div> </div>', 'Bilstein Volkswagen Polo 6R, 2009.06-tól, Bilstein B16, állítható keménységű állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-polo-6r-2009-06-tol-bilstein-b16-allithato-kemenysegu-allithato-magassagu-futomu'),
(1580, '', '<p><strong>Volkswagen Polo 86, 86C MTS-Technik állítható magasságú sport futómű</strong></p>\n\n<ul>\n	<li><strong>Volkswagen Polo 86, </strong>0.9 / 1.1 / 1.3</li>\n	<li><strong>Volkswagen Polo 86C, </strong>0.9 / 1.0 / 1.0 Cat /1.1 / 1.3 / 1.3 Cat, 1.3D / 1.4 D</li>\n	<li><strong>Volkswagen Polo 86 Classic, </strong>1.0 / 1.3 / 1.3 Cat / 1.3 D / 1.4 D</li>\n	<li><strong>Volkswagen Polo 86C Coupé, </strong>1.0 / 1.0 Cat / 1.1 / 1.3 / 1.3 Cat / 1.3 D / 1.3 G40 / 1.4 D</li>\n	<li>Évjárat: 1976.08-1994-ig</li>\n	<li>Ültetés mértéke elõl: 35-85mm</li>\n	<li>Ültetés mértéke hátul: 35-75mm</li>\n	<li>Rugó erõsség (elsõ, fõ rugó): 50 N/mm</li>\n	<li>Rugó erõsség (elsõ, segéd rugó): 5,66 N/mm</li>\n	<li>Rugó erõsség (hátsó, fõ rugó): 30 N/mm</li>\n	<li>Rugó erõsség (hátsó, segéd rugó): 5,66 N/mm</li>\n	<li>Elsõ tengely terhelés: 640kg alatt</li>\n	<li>Hátsó tengely terhelés: 630kg alatt</li>\n	<li>Figyelem! Az elsõ csonkálvány hegesztést igényel! Lásd a szerelési útmutatóban!</li>\n	<li><strong><a href=\"https://mtstechnik.com/data/links/4ab881481d4c6109db49a1e3d43244bc/46766_201244.pdf\"><span>Szerelési útmutató!</span></a></strong></li>\n</ul>\n\n<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár! A magasság fokozatmentesen szabályozható, így könnyedén igazítható az autó hasmagassága az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltéses lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém igénybevétel mellett is</li>\n	<li>két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 86/86C, beleértve G40, 1976.08-1994-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-8686c-beleertve-g40-1976-08-1994-ig-street-series-allithato-magassagu-futomu'),
(1581, '', '<p>Egy állítható magasságú sport futómű, melyet a VW Polo 9N típusú autókhoz terveztek.</p>\\r\\n\\r\\n<p>Ez a futómű ideális választás az 2001.11 - 2009.05 között gyártott autókhoz.</p>\\r\\n\\r\\n<p>Az állítható magasságú sport futómű hátsó tengelyénél a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>Fontos kiemelni, hogy a futómű beszereléséhez szükséges egy rövidített stabilizátor rúd (kutyacsont), mely nem része ennek a szettnek!</p>\\r\\n\\r\\n<p>A tengelyterhelés elöl 960 kg, míg hátul 840 kg lehet.</p>\\r\\n\\r\\n<p>Ez a termék MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>A futóműre 2 ÉV TELJESKÖRŰ GARANCIA vonatkozik, és kiváló minőségű terméket kínál hihetetlenül jó áron!</p>\\r\\n\\r\\n<p>A szett tartalmaz 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db kulcsot az állításhoz.</p>\\r\\n', 'Jom Bochum Volkswagen Polo 9N, 2001.11-2009.05-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-polo-9n-2001-11-2009-05-ig-blue-line-allithato-magassagu-futomu'),
(1582, '', '<div>\\nKínálatunkban megtalálható a Volkswagen Polo 9N modellel kompatibilis sport futómű, melyet a V-Maxx gyártott. Ennek a futóműnek a magassága állítható.', 'V-Maxx Volkswagen Polo 9N, 2001.11-2009.05-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-9n-2001-11-2009-05-ig-allithato-magassagu-futomu'),
(1583, '', '<p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem akarnak kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik Sport futóművei optimális összhangban vannak az Eibach rugókkal és az MTS-Technik lengéscsillapítókkal, biztosítva ezzel maximális vezetési élményt és széles ültetési tartományt.</p>\n<p><u>A következő típusokhoz passzol:</u></p>\n<ul>\n	<li>Skoda Fabia: 1.2 / 1.4 / 1.4 16V / 2.0 / 1.4TDI / 1.9SDI / 1.9TDI</li>\n	<li>Ültetés mértéke elöl: 50-80mm</li>\n	<li>Ültetés mértéke hátul: 50-90mm</li>\n	<li>Első tengely terhelés: 960kg</li>\n	<li>Hátsó tengely terhelés: 840kg</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>Az állítható magasságú futóművek rugóit az Eibach gyártja</li>\n	<li>Speciális Eibach rugók maximális sportossághoz</li>\n	<li>A Sport Series létrehozása során a széles ültetési tartomány és a fokozott vezetési élmény volt a fő szempont</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék karakterisztika:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/sportmts.jpg\" /></strong></u></p>', 'MTS-Technik by Nord Performance Volkswagen Polo 9N, beleértve Cross Polo, 2001.11-2009.05-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-9n-beleertve-cross-polo-2001-11-2009-05-ig-sport-series-allithato-magassagu-futomu'),
(1584, '', '<p>Az MTS-Technik által kifejlesztett Street állítható magasságú sport futóművek ideális választást nyújtanak azoknak a vásárlóknak, akik számára fontos a kiváló minőség és az előnyös ár. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén igazítsa az autó hasmagasságát az útviszonyokhoz. Az MTS-Technik futóműveinek rugói az Eibach által gyártottak, melyek optimális összhangot biztosítanak a lengéscsillapítókkal. A magasság szabadon állítható általában 25 és 80 mm között, emellett gáztöltésű lengéscsillapítókat tartalmaznak. A futóművek két rétegű bevonattal rendelkeznek a hosszantartó korrózióvédelem érdekében. A készlet plug & play, így nincs szükség módosításokra az autó felfüggesztésében.</p>', 'MTS-Technik by Nord Performance Volkswagen Polo 9N, beleértve Cross Polo, 2001.11-2009.05-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-polo-9n-beleertve-cross-polo-2001-11-2009-05-ig-street-series-allithato-magassagu-futomu'),
(1585, '', '<div> \\nEz a Volkswagen Polo 9N modellhez tervezett V-Maxx sport futómű állítható magassággal és keménységgel rendelkezik.', 'V-Maxx Volkswagen Polo 9N, 2001.11-2009.05-ig, állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-polo-9n-2001-11-2009-05-ig-allithato-kemenysegu-allithato-magassagu-futomu'),
(1586, '', '<p>Ez a moduláris AP-Fahrwerke futómű állítható magassággal rendelkezik, amely ideális választás lehet a VW Polo GTI modellhez (9N típuskód) 2005.09-től. Az elő tengely terhelése 960 kg, míg a hátsó tengelyé 840 kg. Fontos megjegyezni, hogy a termék Német nyelvű TÜV engedéllyel rendelkezik.</p>\n<p>Az engedélyben meghatározott ültetés mértéke elöl 20-40 mm, hátul 20-40 mm között állítható, de mindig ennél nagyobb intervallumban. Emellett lehetőség van további ültetésre elöl +30 mm-ig, hátsó tengelyen pedig +0 mm-ig.</p>\n<p>A futóműszettet Németországban, az AP-Fahrwerke gyárában készítik, és garancia vonatkozik rá 2 évig.</p>\n<p><strong>Cikkszám: GF80-039</strong></p>\n<p><br /> Az ár 1 szettre vonatkozik!</p>', 'AP made by KW Volkswagen Polo 9N, csak Gti, 2005.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-polo-9n-csak-gti-2005-09-tol-allithato-magassagu-futomu'),
(1587, '', '<p>Az Ap futómű kifejezetten a sportosan ambiciózus vezetők számára kínál lehetőséget arra, hogy a kívánt ültetést milliméterre pontosan beállítsák. A sportos irányíthatóságot és optimális vezetési viselkedést kombinálva a maximális ültetéssel.</p>\n\n<p>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság párhuzamos egyensúlyát biztosítva optimális felépítést nyújt.</p>\n\n<ul>\n	<li>kiváló minőség, megfizethető áron</li>\n	<li>egyéni magasság beállítás a TÜV által engedélyezett tartományon belül</li>\n	<li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n	<li>kiemelkedő ár/érték arány</li>\n	<li>német minőség</li>\n</ul>\n\n<p>Fontos: Csak a futómű magassága állítható ebben a rendszerben! A keménység nem módosítható!</p>', 'AP made by KW Volkswagen Polo 9N, beleértve Facelift, 2001.09-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-polo-9n-beleertve-facelift-2001-09-tol-allithato-magassagu-futomu'),
(1588, '', '<p>A Vogtland által készített állítható magasságú futómű szett tökéletes választás a Volkswagen Polo modellekhez, beleértve a Typ 9N és a Facelift változatokat is. Ezt a minőségi futóművet úgy tervezték, hogy javítsa az autó megjelenését és optimális vezetési élményt nyújtson. Az ültetés mértéke bármely elképzeléshez igazítható a 35-65/35-65 mm-es tartományban.</p>\n<p>Ez a speciális futómű szett kétcsöves lengéscsillapítókkal rendelkezik, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és a fokozott dinamikát. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók garantálják a tartósságot és hatékonyságot.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, melyek szintező vagy torziós futóművel rendelkeznek.</p>\n<p>Made in Germany!</p>\n<p>Cikkszám: 968558</p>', 'Vogtland Volkswagen Polo 9N, beleértve Facelift, 2001.09-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-polo-9n-beleertve-facelift-2001-09-tol-allithato-magassagu-futomu'),
(1589, '', '<p>A Vogtland állítható magasságú futómű készlet olyan Volkswagen Polo modellekhez készült, melyek évjárata 2005.09-től kezdődik. Ennek a futómű szettnek az ültetés mértéke 20-40 / 20-40 mm lehet, és speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, hogy biztosítsák a kiegyensúlyozott komfortot és dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és a termék TÜV minősítéssel rendelkezik.</p>  \n<p>A Volkswagen Polo futómű szett maximális tengelyterhelése elől 960 kg, hátul pedig 840 kg. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>A Vogtland futómű készlet Made in Germany, és cikkszáma: 968730.</p>', 'Vogtland Volkswagen Polo 9N GTi, 2005.09-től állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-polo-9n-gti-2005-09-tol-allithato-magassagu-futomu'),
(1590, '', '<div><strong>Volkswagen Polo 9N Bilstein B14 sport futómű állítható magassággal</strong></div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az ültetés mértéke az első tengelyen: 45 - 65 mm</div>\\r\\n\\r\\n<div>Az ültetés mértéke a hátsó tengelyen: 45 - 60 mm</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Az első tengely terhelése: 960 kg</div>\\r\\n\\r\\n<div>A hátsó tengely terhelése: 835 kg</div>\\r\\n\\r\\n<div> </div>\\r\\n\\r\\n<div>Ez a termék rendelkezik TÜV engedéllyel!</div>\\r\\n', 'Bilstein Volkswagen Polo 9N, 2001.11-2009.05-ig, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-polo-9n-2001-11-2009-05-ig-bilstein-b14-allithato-magassagu-futomu'),
(1591, '', '<strong>Volkswagen Golf 1 MTS-Technik Street sport futómű</strong></p>  <p>Az MTS-Technik által kínált állítható magasságú sport futóművek kiváló választást nyújtanak azoknak, akik számára fontos a prémium minőség és a versenyképes ár. A magasság fokozatmentesen állítható, lehetővé téve az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimális egyensúlyt biztosítanak a rugók és a lengéscsillapítók között.</p>  <p><u>A futómű a következő típusokhoz illeszkedik:</u></p>  <ul> 	<li><strong>Volkswagen Golf 1, </strong>1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> 	<li><strong>Volkswagen Golf 1 Cabrio,</strong> 1.5 / 1.6 / 1.8</li> 	<li>Elülső ültetés: 35-80mm</li> 	<li>Hátsó ültetés: 35-80mm</li> 	<li>Elülső tengely terhelés: 785kg</li> 	<li>Hátsó tengely terhelés: 640kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság szabadon állítható általában 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u>Termék karakterisztika:</u></p>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Scirocco, 1974-1992-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-scirocco-1974-1992-ig-street-series-allithato-magassagu-futomu'),
(1592, '', '<p>A <strong>MTS-Technik Comfort állítható magasságú sport futómű</strong> ideális választás azoknak, akik számára fontos a sportos megjelenés és az utazási kényelem is. A futómű magassága könnyedén és fokozatmentesen állítható az útviszonyoknak megfelelően. Az <strong>MTS-Technik Comfort futóművek</strong> tökéletes egyensúlyban vannak az <strong>Eibach rugók</strong> és az <strong>MTS-Technik lengéscsillapítók</strong> között.</p>\n<p><u>Alábbi típusokhoz kompatibilis:</u></p>\n<ul>\n	<li><strong>Volkswagen Golf 1, </strong>1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li>\n	<li><strong>Volkswagen Golf 1 Cabrio, </strong>1.5 / 1.6 / 1.8</li>\n	<li>Elülső ültetés: 35-80mm</li>\n	<li>Hátsó ültetés: 35-80mm</li>\n	<li>Elülső tengely terhelés: 785kg</li>\n	<li>Hátsó tengely terhelés: 640kg</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A rugókat az <strong>Eibach</strong> gyártja</li>\n	<li>Speciális <strong>Eibach rugók</strong> a maximális kényelem érdekében</li>\n	<li>A <strong>Comfort Series</strong> célja a magas kényelem, nem az extrém ültetés</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Kettős bevonat a hosszú élettartam érdekében</li>\n	<li>Tökéletes összhang rugók és lengéscsillapítók között</li>\n	<li>Plug & play készlet, nem igényel módosítást a felfüggesztésben</li>\n</ul>\n<p><u><strong>Termék jellemzők:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/comfortmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Scirocco, 1974-1992-ig, Comfort Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-scirocco-1974-1992-ig-comfort-series-allithato-magassagu-futomu'),
(1593, '', '<strong>Állítható magasságú sport futómű a Volkswagen Golf 1-hez az MTS-Technik Sport Series-től</strong></p>  <p>Az MTS-Technik Sport Series állítható magasságú sport futóművei ideális választás azoknak, akik nem szeretnének kompromisszumot kötni. A magasság fokozatmentesen állítható, így könnyedén igazítható az útviszonyokhoz. Az MTS-Technik Sport futóműveiben az Eibach rugók és MTS-Technik lengéscsillapítók optimális egyensúlya van. A széles ültetési tartomány és a maximális vezetési élmény garantált!</p>  <p><u>A futómű a következő típusokhoz passzol:</u></p>  <ul> 	<li><strong>Volkswagen Golf 1:</strong> 1.1 / 1.3 / 1.5 / 1.6 / 1.6 GTI / 1.8 GTI / 1.5D / 1.6D / 1.6TD</li> 	<li><strong>Volkswagen Golf 1 Cabrio:</strong> 1.5 / 1.6 / 1.8</li> 	<li>Ültetés mértéke elöl: 35-80mm</li> 	<li>Ültetés mértéke hátul: 35-80mm</li> 	<li>Első tengely terhelés: 785kg</li> 	<li>Hátsó tengely terhelés: 640kg</li> </ul>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók a maximális sportosság érdekében</li> 	<li>A Sport Series létrehozása során a fokozott vezetési élmény volt a fő szempont</li> 	<li>Gáztöltéses lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><u><strong>Termék karakterisztika:</strong></u></p>  <p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></strong></u></p>  <p><em>A weboldal szöveges tartalmainak, képeinek másolása, sokszorosítása tilos engedély nélkül!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Scirocco, 1974-1992-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-scirocco-1974-1992-ig-sport-series-allithato-magassagu-futomu'),
(1594, '', '<div> <p>Ez a AP-Fahrwerke Állítható magasságú futómû az alábbi autótípusba illeszkedik:</p>  <ul> 	<li>VW Jetta 1 Beleértve: Cabrio</li> 	<li>Tipuskód: 17,155</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 1974.04 - 1993.08</li> 	<li>Tengelyterhelés elöl (kg): 785</li> 	<li>Tengelyterhelés hátul (kg): 640</li> 	<li>Egyéb kitételek: -</li> </ul>  <ul> 	<li>Ez a futómûszett rendelkezik Német nyelvû TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-70 mm, hátul: 40-70 mm között állítható<br /> 	(Minden esetben ennél nagyobb intervallumban állítható a futómû, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li> 	<li>Plussz ültetés lehetõség elöl: +40 mm, hátul: +40 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>2 év garancia e termékre</li> </ul>  <p><strong>Cikkszáma: GF80-001</strong></p>  <p><br /> Az ár 1 szettre vonatkozik!</p> </div> ', 'AP made by KW Volkswagen Scirocco MK1-2, 1974-1992-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-scirocco-mk1-2-1974-1992-ig-allithato-magassagu-futomu'),
(1595, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett kompatibilis a VOLKSWAGEN SCIROCCO modellekkel. Az évjárat 1979-1992 közöttre tehető. Az ültetés mértéke 40-70 mm elöl és 40-70 mm hátul. A futóművet használhatja Volkswagen Scirocco I, II, Typ 53, 53B típusú autókon. A maximális tengelyterhelés elöl 785 kg, míg hátul 640 kg. A futómű engedélyezett és minősített, további információkért <a href=\\\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF01_1537-10.pdf\\\" target=\\\"_blank\\\">itt</a> találhatóak.</p>\n\n<p>Ez a futómű szett nemcsak javítja az autó megjelenését, hanapság vezetési élményt is biztosít. Az ültetés mértékét személyre szabhatja az egyéni igényei szerint. A futómű tartalmaz kétcsöves lengéscsillapítókat alacsony nyomású gázrendszerrel, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n\n<p>A futómű TÜV minősítéssel büszkélkedhet. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n\n<p>A termék \"Made in Germany\" minőséget garantál. Cikkszám: 968371</p>', 'Vogtland Volkswagen Scirocco MK1-2, 1974-1992-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-scirocco-mk1-2-1974-1992-ig-allithato-magassagu-futomu'),
(1596, '', '<div><strong>Volkswagen Scirocco JOM BlueLine Állítható magasságú futómû</strong></div> <div>Tipuskód: 13</div> <div>Változat: 1.4TSI/ 2.0TSI/ 2.0TDI/ DSG ø50/55 mm!!</div> <div>Évjárat: 2008 -tól</div> <div>Tengelyterhelés elöl (kg): 1080</div> <div>Tengelyterhelés hátul (kg): 770</div> <div>Ez a futómű összeállítás rendelkezik német nyelvű TÜV engedéllyel!</div> <div>Az engedély által meghatározott ültetés mértéke elöl: 20-60mm, hátul: 30-75mm között állítható</div> <div>(Általában nagyobb tartományban is állítható a futómű, azonban a TÜV engedély csak a fent említett beállításokat engedélyezi.)</div> <div>Készült JOM Németországban</div> <div>Cikkszáma: 741070</div> <div> </div> <div>Az ár egy szettre vonatkozik!</div> <div>A JOM BlueLine Állítható magasságú futóműkészlet kiváló minőségű, autóspecifikus alkatrészekből áll.</div> <div>A magasság beállítása személyes igények szerint változtatható az fent említett paraméterek között.</div> <div>A rugókeménység és a csillapítás mértéke az egész beállítási tartományban azonos.</div> <div>Különösen nagy kanyarstabilitást biztosít, mivel nagyon ellenáll a keresztirányú erőknek.</div>', 'Jom Bochum Volkswagen Scirocco, 2008.08-tól állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-scirocco-2008-08-tol-allithato-magassagu-futomu'),
(1597, '', '<br />  <div><br />    <em>A Volkswagen Scirocco-hoz rendelhető állítható magasságú sport futómű</em><br />  </div><br />', 'V-Maxx Volkswagen Scirocco, 2008-tól, 55mm-es szárátmérő állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-scirocco-2008-tol-55mm-es-szaratmer-allithato-magassagu-futomu'),
(1598, '', '<div>\\n    Egy olyan autó, mely a sportosságot és a felfüggesztést ötvözi, a Volkswagen Scirocco.\\n    Az autó magassága állítható.\\n</div>', 'V-Maxx Volkswagen Scirocco, 2008-tól, 55mm-es szárátmérő, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-scirocco-2008-tol-55mm-es-szaratmer-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1599, '', '<div>\n<p>Ez az AP-Fahrwerke Állítható magasságú futómű megfelel az alábbi autótípusnak:</p>\n\n<ul>\n	<li>VW Scirocco 3 Első kerék hajtás</li>\n	<li>Tipuskód: 13</li>\n	<li>Évjárat: 2008.09-től</li>\n	<li>Tengelyterhelés elöl (kg): 1080</li>\n	<li>Tengelyterhelés hátul (kg): 770</li>\n	<li>Egyéb információk: Kizárólag 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.<br />\n		Adaptív futóművel (DCC) rendelkező járműveknél az elektronikus vezérlőegység inaktiválása szükséges!</li>\n</ul>\n\n<ul>\n	<li>Ez a futóműkészlet rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 20-55 mm, hátul: 20-55 mm között állítható<br />\n		(Minden esetben ennél nagyobb intervallumban állítható a futómű, de a TÜV engedély csak a fenti említett beállításokkal érvényes.)</li>\n	<li>Extra ültetési lehetőség elöl: +30 mm, hátul: +16 mm</li>\n</ul>\n\n<ul>\n	<li>Gyártva Ap-Fahrwerke Németországban</li>\n	<li>Garancia erre a termékre: 2 év</li>\n</ul>\n\n<p>Az ár egy szettre vonatkozik!</p>\n</div>', 'AP made by KW Volkswagen Scirocco, kivéve 4-Motion, 2008.09-től, (első tengely terhelés 1080kg alatt) állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-scirocco-kiveve-4-motion-2008-09-tol-els-tengely-terheles-1080kg-alatt-allithato-magassagu-futomu'),
(1600, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN SCIROCCO</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2008-tól</li>\n	<li><strong>Ültetés mértéke:</strong> 20 - 55 / 20 - 55 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Scirocco III, Typ 13, 2WD, a lengéscsillapító ház átmérõ 55 mm</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 1000 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 770 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett teljes körű vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét az egyéni igényeknek megfelelően állíthatja be. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek a alacsony nyomású gázrendszernek köszönhetően biztosítják a kiegyensúlyozott komfortérzetet és nagyobb dinamikát. A lengéscsillapítók kiváló korrózióvédelemmel rendelkeznek.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően tartalmaz 4 db ültetőrugót és 4 db lengéscsillapítót, kivéve azoknál az autótípusoknál, amelyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Németországban készült!</p>\n<p>Cikkszám: 968372</p>', 'Vogtland Volkswagen Scirocco, 2008.09-től, (első tengely terhelés: 1000kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-scirocco-2008-09-tol-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(1601, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómû szett</span>: VOLKSWAGEN SCIROCCO</p>  \n<ul> 	\n<li><strong>Évjárat</strong>: 2008-tól</li> 	\n<li><strong>Ültetés mértéke:</strong> 20 - 55 / 20 - 55 mm</li> 	\n<li><strong>Típus</strong>: Volkswagen Scirocco III, Typ 13, 2WD, a lengéscsillapító ház átmérõ 55 mm</li> 	\n<li><strong>Max. tengelyterhelés elõl</strong>: 1080 kg</li> 	\n<li><strong>Max. tengelyterhelés hátul</strong>: 770 kg</li> \n</ul>  \n<p>Az autó kinézetének javítása mellett kiváló vezetési élményt nyújt ez a futómű szett. A beállítások lehetővé teszik az ültetés mértékének személyre szabását. A kitűnő minőségű futómű csak speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek kiegyensúlyozott kényelmet és fokozott dinamikát biztosítanak a alacsony nyomású gázrendszernek köszönhetően. A lengéscsillapítók rendkívül ellenállók a korróziónak.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra.</p>  \n<p>A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>Németországban gyártva!</p>  \n<p>Cikkszám: 968373</p>  ', 'Vogtland Volkswagen Scirocco, 2008.09-től, (első tengely terhelés: 1000kg fölött) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-scirocco-2008-09-tol-els-tengely-terheles-1000kg-folott-allithato-magassagu-futomu'),
(1602, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett megfelelő választás lehet a Volkswagen Scirocco III típusú autókhoz, melyek esetében a lengéscsillapító ház átmérője 55 mm. Ennek a minőségi futómű szetnek az egyik kiemelkedő tulajdonsága, hogy két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, így biztosítva a kiegyensúlyozott komfortot és fokozott dinamikát. A termék TÜV minősítéssel rendelkezik, így garantálva a biztonságot és minőséget. Ezen kívül a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>\n<p>A szett alapvetően tartalmaz 4 db ültető rugót és 4 db lengéscsillapítót, azonban kivételek lehetnek azoknál az autóknál, melyek szintezős vagy torziós futóművel vannak felszerelve. Fontos megjegyezni, hogy a DDC futóművel szerelt típusok esetében szükséges a DDC deaktiváló szett használata, melyet a csomag tartalmaz. A Vogtland futóművei Made in Germany minőségjelzéssel büszkélkedhetnek.</p>', 'Vogtland Volkswagen Scirocco, csak DDC futóművel, 2008-tól, 55mm szárátmérő, (első tengely terhelés 1000kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-scirocco-csak-ddc-futomuvel-2008-tol-55mm-szaratmer-els-tengely-terheles-1000kg-alatt-allithato-magassagu-futomu'),
(1603, '', '<p>A Vogtland állítható magasságú futómű szett ideális választás lehet a 2008-tól gyártott Volkswagen Scirocco III modellekhez. Ez a futómű kiválóan javítja az autó megjelenését és biztosítja a maximális vezetési élményt. A szett lehetővé teszi az ültetés mértékének szabályozását a saját igényeink szerint. A csomag tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók korrózióvédelemmel rendelkeznek, és a termék TÜV minősítéssel rendelkezik. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra. A szett alapesetben 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve a szintezős vagy torziós futóművel szerelt autók esetében.</p> <p>Made in Germany!</p>', 'Vogtland Volkswagen Scirocco, csak DDC futóművel, 2008-tól, 55mm szárátmérő, (első tengely terhelés 1001-1080kg) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-scirocco-csak-ddc-futomuvel-2008-tol-55mm-szaratmer-els-tengely-terheles-1001-1080kg-allithato-magassagu-futomu'),
(1604, '', '<div><strong><span>Volkswagen Golf 6 Bilstein B14 állítható magasságú futómű</span></strong><br />\\r\\n<br />\\r\\n<span>A BILSTEIN egycsöves rendszer jellemzi ezt a futóművet, mely Upside-Down technológiával és nagy szilárdságú versenysportrugókkal van ellátva. Az állítható magasság lehetővé teszi a rugótányér és a kontra anya alumíniumból készült változtatását. A B14-gyel a BILSTEIN mérnökei versenysport technológiát hoztak az utcai használatba, ahol a jármű magassága akár 50 mm-rel is csökkenthető az első és hátsó tengelyeken belül. Az extrém terhelhetőségű egycsöves Upside-Down technológia biztosítja a kiegyensúlyozott menetteljesítményt és a vezetés örömét a B14 PSS modellben egy behatárolt 20mm-es állítási tartományon belül.</span></div>\\r\\n', 'Bilstein Volkswagen Scirocco, 2008.05-től, 55mm szárátmérővel, Bilstein B14 állítható magasságú futómű', '', '', '', 'bilstein-volkswagen-scirocco-2008-05-tol-55mm-szaratmervel-bilstein-b14-allithato-magassagu-futomu'),
(1605, '', '<p>Állítható magasságú FK-Automotive AK Street futómű Volkswagen Sharan autókhoz.</p>\\r\\n\\r\\n<ul>\\r\\n	<li>Autótípus: Volkswagen Sharan</li>\\r\\n	<li>Évjárat:.: 1995-2010</li>\\r\\n</ul>\\r\\n\\r\\n<ul>\\r\\n	<li>A futómű elöl és hátul is szabályozható magasságú</li>\\r\\n	<li>A FK-Automotive AK Street futómű nagy intervallumban változtatható magasságú</li>\\r\\n	<li>A futómű sportos, feszes és tartós kivitelű</li>\\r\\n	<li>A termék rendelkezik német nyelvű TÜV engedéllyel</li>\\r\\n	<li>Anyaga: Acél</li>\\r\\n	<li>Cikkszám: SMVW9027</li>\\r\\n</ul>\\r\\n', 'FK-Automotive Volkswagen Sharan, 1995-2010-ig állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-sharan-1995-2010-ig-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1606, '', '<div>\n	<p>Ez a magasságállítható futómű tökéletesen illeszkedik a következő autótípushoz:</p>\n	<ul>\n		<li>Volkswagen T-Roc</li>\n		<li>Tipuskód: A1, A11</li>\n		<li>Beleértve Cabrio modellek</li>\n		<li>Évjárat: 2017.11-től</li>\n		<li>Tengelyterhelés elöl (kg): 1100</li>\n		<li>Tengelyterhelés hátul (kg): 1050</li>\n		<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n		<li>Az engedélyben meghatározott ültetés mértéke elöl: 40-60 mm, hátul: 35-60 mm között állítható (A futómű ennél nagyobb intervallumban is állítható, azonban a TÜV engedély csak ezen beállításokra érvényes.)</li>\n		<li>Gyártó: Ap-Fahrwerke Németország</li>\n		<li>Garancia: 2 év</li>\n	</ul>\n</div>', 'AP made by KW Volkswagen T-Roc (Typ: A1), beleértve 4-Motion, Cabrio, T-Roc R, 2017.11-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-t-roc-typ-a1-beleertve-4-motion-cabrio-t-roc-r-2017-11-tol-allithato-magassagu-futomu'),
(1607, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás lehet a Volkswagen T-Roc modellekhez, amelyekhez 2019.08-tól szerelhető fel. Ez a minőségi futómű javítja az autó megjelenését és biztosítja a maximális vezetési élményt. Az ültetés mértéke széles skálán állítható, lehetőséget adva a személyre szabásra. A szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, amelyek alacsony nyomású gázrendszerüknek köszönhetően kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók hozzájárulnak az autó stabilitásához.</p>\n<p>A termék rendelkezik TÜV minősítéssel, és a gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra. A szett általában 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autóknál, amelyekben szintezős vagy torziós futómű van beépítve.</p>\n<p>A Vogtland futóművek Made in Germany minősítéssel büszkélkednek, így garantálva a német minőséget és megbízhatóságot.</p>', 'Vogtland Volkswagen T-Roc (Typ: A1), beleértve 4-Motion, Cabrio, T-Roc R, 2019.08-tól állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-t-roc-typ-a1-beleertve-4-motion-cabrio-t-roc-r-2019-08-tol-allithato-magassagu-futomu'),
(1608, '', '<p><strong>Audi Q3 Street Series MTS-Technik állítható magasságú sport futómű</strong></p>  \n<ul>  \n	<li>Az Audi Q3 különböző típusaihoz megfelelő sport futómű</li>  \n	<li>Állítható ültetés elől: 35-65mm</li>  \n	<li>Állítható ültetés hátul: 35-65mm</li>  \n	<li>Elülső tengely terhelhetősége: 1200kg</li>  \n	<li>Hátsó tengely terhelhetősége: 1170kg</li>  \n	<li>A futómű jelenleg nincs TÜV engedéllyel ellátva, az engedélyeztetés folyamatban van</li>  \n</ul>  \n<p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik minőségi és megfizethető árú terméket keresnek. A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben tökéletes az egyensúly a rugók és a lengéscsillapítók között.</p>  \n<p><u>Termékjellemzők:</u></p>  \n<ul>  \n	<li>A rugókat az Eibach gyártja</li>  \n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>  \n	<li>Gáztöltésű lengéscsillapítók</li>  \n	<li>Magas hatékonyság extrém körülmények között is</li>  \n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>  \n	<li>Tökéletes egyensúly a rugók és a lengéscsillapítók között</li>  \n	<li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésében</li>  \n</ul>  \n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>  \n<p><em>A weboldal szöveges tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Tiguan (Typ: 5N), beleértve 4-Motion, 2007.09-2018.07-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-typ-5n-beleertve-4-motion-2007-09-2018-07-ig-street-series-allithato-magassagu-futomu'),
(1609, '', '<strong>MTS-Technik állítható magasságú sport futómű a Audi Q3 Sport Series számára</strong></p>  <ul> 	<li>Audi Q3 (Typ: 8U), különböző motorváltozatokkal és hajtáskombinációkkal</li> 	<li>Elülső ültetés mértéke: 35-65mm</li> 	<li>Hátsó ültetés mértéke: 35-65mm</li> 	<li>Elülső tengely terhelés: 1200kg</li> 	<li>Hátsó tengely terhelés: 1170kg</li> 	<li>TÜV engedély hiánya (jelenlegi engedélyeztetés alatt)</li> </ul>  <p>Az állítható magasságú MTS-Technik Sport Series futóművei kiváló választás azoknak, akik nem akarnak kompromisszumot kötni. A futómű fokozatmentesen állítható magassága lehetővé teszi az könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik Sport futóművei tökéletes összhangban vannak az Eibach rugókkal és lengéscsillapítókkal, biztosítva a maximális vezetési élményt és a széles ültetési tartományt.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futómű rugóit az Eibach gyártja</li> 	<li>Speciális Eibach rugók a sportosság érdekében</li> 	<li>A Sport Series létrehozásakor a cél a szélesebb ültetési tartomány és a fokozott vezetési élmény elérése volt</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Magas hatékonyság extrém igénybevétel mellett is</li> 	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li> 	<li>Tökéletes összhang rugó és lengéscsillapító között</li> 	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/sportmts.jpg\\\" /></p>  <p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p> ', 'MTS-Technik by Nord Performance Volkswagen Tiguan (Typ: 5N), beleértve 4-Motion, 2007.09-2018.07-ig, Sport Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-typ-5n-beleertve-4-motion-2007-09-2018-07-ig-sport-series-allithato-magassagu-futomu'),
(1610, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómű olyan autótípushoz készült, amelyben első kerék hajtás és Quattro rendszer található. Az első lengéscsillapító átmérője 55mm.</p>  <ul> 	<li>Audi Q3</li> 	<li>Tipuskód: 8U</li> 	<li>Évjárat: 2011.10-től</li> 	<li>Tengelyterhelés elöl (kg): 1190</li> 	<li>Tengelyterhelés hátul (kg): 1170</li> 	<li>Egyéb kitételek: Csak 55mm átmérőjű első lengéscsillapító-szár átmérőjű modellekhez.</li> </ul>  <ul> 	<li>Ez a futómű Németországban gyártott és rendelkezik Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben meghatározott ültetési tartomány elöl: 35-65 mm, hátul: 35-65 mm között állítható<br /> 	(Más beállítások is lehetségesek, de a TÜV engedély csak erre vonatkozik.)</li> 	<li>Plussz ültetés lehetőség elöl: +10 mm, hátul: +0 mm</li> </ul>  <ul> 	<li>Gyártó: Ap-Fahrwerke</li> 	<li>Garancia: 2 év</li> </ul>  <p><strong>Cikkszám: GF80-077</strong></p>  <p><br /> Az ár 1 szettre értendő!</p> </div>  <div><span>Az AP futómű lehetőséget biztosít a sportosan ambiciózus vezetők számára, hogy milliméteres pontossággal állítsák be az általuk kívánt ültetést. A sportos irányíthatóságot és optimális vezetési viselkedést kombinálva a maximális ültetést nyújtjuk.</span></div>  <div>Egy alumínium rugótányér segítségével a járműmagasságot az engedélyezett tartományon belül egyénileg beállíthatja. A sportosság, a kényelem és a biztonság tökéletes egyensúlyát nyújtva optimális vezetést biztosít.</div>  <ul> 	<li>Magas minőségű termék megfizethető áron</li> 	<li>Egyedi magasságbeállítás a TÜV által engedélyezett tartományon belül</li> 	<li>Kiváló minőségű alkatrészek és TÜV tanúsítvány</li> 	<li>Kiemelkedő ár-érték arány</li> 	<li>Német minőség</li> </ul> ', 'AP made by KW Volkswagen Tiguan (Typ: 5N), beleértve 4-Motion, 2007.11-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-tiguan-typ-5n-beleertve-4-motion-2007-11-tol-allithato-magassagu-futomu'),
(1611, '', '<p>A Volkswagen Tiguan MTS-Technik Street állítható magasságú sport futóművei ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. A futómű fokozatmentesen állítható magassága lehetővé teszi, hogy könnyedén alkalmazkodjunk az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlya biztosított.</p>\n\n<p><u>Az alábbi típusokhoz ajánlott:</u></p>\n\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1)</strong> - 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\n	<li>Elülső ültetés: 35-55mm</li>\n	<li>Hátsó ültetés: 30-55mm</li>\n	<li>Elülső tengely terhelés: 1061-1190kg</li>\n	<li>Hátsó tengely terhelés: 1390kg</li>\n	<li>Elülső fő rugó erőssége: 45 N/mm</li>\n	<li>Hátsó fő rugó erőssége: 55 N/mm</li>\n	<li>A termék jelenleg nem rendelkezik TÜV engedéllyel, az engedélyezés folyamatban van.</li>\n</ul>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság általában 25 és 80 mm között állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelem érdekében</li>\n	<li>Rugó és lengéscsillapító tökéletes összhangja</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása szigorúan tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Tiguan, 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi, 2016.01-től, (első tengely terhelés 1061-1190kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-1-4tsi-1-5tsi-1-6tdi-2-0tdi-2016-01-tol-els-tengely-terheles-1061-1190kg-street-series-allithato-magassagu-futomu'),
(1612, '', '<strong>Volkswagen Tiguan MTS-Technik Street állítható magasságú sport futómű</strong></p>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futóművei megfelelő választást nyújtanak azoknak, akik a minőséget és az ár-érték arányt tartják fontosnak. A futómű fokozatmentesen állítható magassága lehetővé teszi az autó hasmagasságának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei rugalmas összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Az alábbi típusokhoz kompatibilis:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1),</strong> 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi</li>\\r\\n	<li>Elülső ültetés: 35-55mm</li>\\r\\n	<li>Hátsó ültetés: 30-55mm</li>\\r\\n	<li>Elülső tengely terhelés: 1060kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1390kg</li>\\r\\n	<li>Rugó erőssége (elülső): 40 N/mm</li>\\r\\n	<li>Rugó erőssége (hátsó): 55 N/mm</li>\\r\\n	<li>Nincs TÜV engedély! Engedélyezés folyamatban!</li>\\r\\n</ul>\\r\\n\\r\\n<p><u>Termékjellemzők:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A futóművek rugóit az <strong>Eibach</strong> vállalat gyártja</li>\\r\\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>Gáztöltésű lengéscsillapítók</li>\\r\\n	<li>Magas hatékonyság extrém terhelés esetén is</li>\\r\\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cinkbevonat és fekete anódizált alumínium alkatrészek)</li>\\r\\n	<li>Rugalmas egyensúly a rugók és a lengéscsillapítók között</li>\\r\\n	<li>A készlet plug & play, nem igényel változtatást az autó felfüggesztésén</li>\\r\\n</ul>\\r\\n\\r\\n<p><u><strong>Termék jellemzői:</strong></u></p>\\r\\n\\r\\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\\r\\n\\r\\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és terjesztése tilos!</em></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p> </p>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Tiguan, 1.4TSi, 1.5TSi, 1.6TDi, 2.0TDi, 2016.01-től, (első tengely terhelés 1060kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-1-4tsi-1-5tsi-1-6tdi-2-0tdi-2016-01-tol-els-tengely-terheles-1060kg-alatt-street-series-allithato-magassagu-futomu'),
(1613, '', '<strong>Volkswagen Tiguan MTS-Technik Street állítható magasságú sport futómű</strong></p>\n<p>A MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választást nyújtanak azoknak a vásárlóknak, akik számára fontos a kiváló minőség és az elérhető ár. A futómű fokozatmentesen állítható magassága lehetővé teszi az könnyű beállítást az útviszonyoknak megfelelően. Az MTS-Technik futóműveiben a rugók és lengéscsillapítók optimális összhangban vannak.</p>\n<p><u>A futómű az alábbi típusokhoz kompatibilis:</u></p>\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1),</strong> 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Elülső ültetés: 35-55mm</li>\n	<li>Hátsó ültetés: 30-55mm</li>\n	<li>Elülső tengely terhelés: 1101-1240kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Rugó erősség (elülső): 45 N/mm</li>\n	<li>Rugó erősség (hátsó): 60 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel - az engedélyezés folyamatban van</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszú távú korrózióvédelemért (sárga cink bevonat és fekete anodizált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása és sokszorosítása tilos!</em></p>\n<p> </p>\n<p> </p>', 'MTS-Technik by Nord Performance Volkswagen Tiguan Allspace, 2.0TSi 4-Motion, 2.0TDi 4-Motion, 2017.03-tól, (első tengely terhelés 1101-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-allspace-2-0tsi-4-motion-2-0tdi-4-motion-2017-03-tol-els-tengely-terheles-1101-1240kg-street-series-allithato-magassagu-futomu'),
(1614, '', '<strong>MTS-Technik Street állítható magasságú sport futómű a Volkswagen Tiguanhoz</strong></p>\n<p>Az MTS-Technik állítható magasságú sport futóművei kiváló választás azok számára, akik minőségi terméket keresnek megfizethető áron. A futómű fokozatmentesen állítható magassága könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n<p><u>Passzoló típusok:</u></p>\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1)</strong> - 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Ültetés mértéke elöl: 35-55mm</li>\n	<li>Ültetés mértéke hátul: 30-55mm</li>\n	<li>Első tengely terhelés: 1101-1240kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Rugó erősség (első, fő rugó): 45 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van</li>\n</ul>\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel esetén is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n<p><u><strong>Termék jellemzői:</strong></u></p>\n<p><u><strong><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></strong></u></p>\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>\n<p> </p>\n<p> </p>', 'MTS-Technik by Nord Performance Volkswagen Tiguan, 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion, 2016.01-től, (első tengely terhelés 1101-1240kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-1-4tsi-4-motion-2-0tsi-4-motion-2-0tsi-r-4-motion-2-0tdi-4-motion-2016-01-tol-els-tengely-terheles-1101-1240kg-street-series-allithato-magass'),
(1615, '', '<p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az megfizethető ár! A magasság fokozatmentesen állítható, így könnyedén alkalmazkodik az útviszonyokhoz. Az MTS-Technik futóművekben a rugók és a lengéscsillapítók tökéletes összhangban vannak.</p>\n\n<u>Az alábbi típusokhoz kompatibilis:</u>\n\n<ul>\n	<li><strong>Volkswagen Tiguan (Typ: AD1, AX1), </strong>1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion</li>\n	<li>Elülső ültetés: 35-55mm</li>\n	<li>Hátsó ültetés: 30-55mm</li>\n	<li>Elülső tengely terhelés: 1100kg</li>\n	<li>Hátsó tengely terhelés: 1400kg</li>\n	<li>Elülső fő rugó erőssége: 40 N/mm</li>\n	<li>Hátsó fő rugó erőssége: 60 N/mm</li>\n	<li>Nem rendelkezik TÜV engedéllyel, az engedélyeztetés folyamatban van</li>\n</ul>\n\n<u>Termékjellemzők:</u>\n\n<ul>\n	<li>A futómű rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság általában 25 és 80 mm között szabadon állítható</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém terhelés mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugó és a lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<u><strong>Termék jellemzők:</strong></u>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>A weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Tiguan, 1.4TSi 4-Motion, 2.0TSi 4-Motion, 2.0TSi R 4-Motion, 2.0TDi 4-Motion, 2016.01-től, (első tengely terhelés 1100kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-tiguan-1-4tsi-4-motion-2-0tsi-4-motion-2-0tsi-r-4-motion-2-0tdi-4-motion-2016-01-tol-els-tengely-terheles-1100kg-alatt-street-series-allithato-magas'),
(1616, '', '<p> Az alkatrész egy olyan autótípushoz illeszkedik, melyhez rövidített stabilizátor rúd (kutyacsont) szükséges. A futómű MADE IN GERMANY és TÜV engedéllyel rendelkezik. A termék 2 ÉV TELJESKÖRŰ GARANCIÁVAL érhető el és kiváló minőségű, hihetetlenül jó áron kapható. A szett tartalmaz 4 darab lengéscsillapítót a hozzá tartozó rugókkal, valamint egy állítókulcsot. </p>', 'Jom Bochum Volkswagen Touran, 2003-2010-ig, (első tengely terhelés: 1106-1200kg) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-touran-2003-2010-ig-els-tengely-terheles-1106-1200kg-allithato-magassagu-futomu'),
(1617, '', '<p>Ez a termék kompatibilis a Volkswagen Touran autótípushoz, melynek típuskódja 1T, és az évjárata 2004-től 2012-ig terjed. Fontos, hogy a futómű beszereléséhez szükséges egy rövidített stabilizátor rúd, mely nem része ennek a szettnek. Az autó tengelyterhelése elöl 1105 kg, míg hátul 1250 kg.</p><ul><li>MADE IN GERMANY</li><li>A futómű rendelkezik TÜV engedéllyel, melyet a csomagolás tartalmaz.</li><li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li><li>Kiváló minőség, rendkívül kedvező áron!</li><li>A csomag tartalmazza: 4 db lengéscsillapítót a hozzá tartozó rugókkal, valamint 1 db állítókulcsot.</li></ul>', 'Jom Bochum  Volkswagen Touran, 2003-2010-ig, (első tengely terhelés: 1105kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum--volkswagen-touran-2003-2010-ig-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1618, '', '<p><strong>Volkswagen Passat B7 MTS-Technik Street Series állítható magasságú sport futómû</strong></p>\\r\\n\\r\\n<p><u>A következõ típusokhoz: </u></p>\\r\\n\\r\\n<ul>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Sedan,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li><strong>Volkswagen Passat 3C B7 Variant,</strong> 1.4TSi, 1.6, 1.6FSi, 1.8TSi, 2.0FSi, 1.6TDi, 1.9TDi, 2.0TDi, 2.0 FSi 4motion, 3.2 FSi 4motion, 3.6 R36 4motion, 2.0TDi 4motion</li>\\r\\n	<li>Elsõ tengely terhelés: 1100-1180 kg</li>\\r\\n	<li>Hátsó tengely terhelés: 1230 kg alatt</li>\\r\\n	<li>Ültetés mértéke elõl: 35-70 mm</li>\\r\\n	<li>Ültetés mértéke hátul: 35-60 mm</li>\\r\\n	<li><strong>A futómû beszereléséhez rövidített stabilizátor szett használata ajánlott! A szett NEM tartalmazza. Kompatibilis cikkszámok: SBMO (V-Maxx), 740412 (JOM Bochum), EVOPE003 (TA-Technix)</strong></li>\\r\\n</ul>\\r\\n\\r\\n<p>Az MTS-Technik állítható magasságú sport futómûvei ideális választás azoknak, akik fontosnak tartják a kiváló minõséget és az ésszerû árakat. Az útviszonyoknak megfelelõen állítható hasmagasság fokozatmentesen. Az MTS-Technik futómûvei kitűnő összhangot teremtenek a rugók és a lengéscsillapítók között.</p>\\r\\n\\r\\n<p><u>Termékjellemzõk:</u></p>\\r\\n\\r\\n<ul>\\r\\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\\r\\n	<li><strong>a termék rendelkezik TÜV engedéllyel!</strong></li>\\r\\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\\r\\n	<li>gáztöltésű lengéscsillapítók</li>\\r\\n	<li>magas hatékonyság extrém igénybevétel mellett is</li>\\r\\n	<li>két rétegű bevonat a hosszan tartó korrózióvédelemért (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li>\\r\\n	<li>tökéletes összhang rugó és lengéscsillapító között</li>\\r\\n	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\\r\\n</ul>\\r\\n\\r\\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\\r\\n', 'MTS-Technik by Nord Performance Volkswagen Cross Touran (Typ: 1T), 2008.01-től, (első tengely terhelés 1200kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-cross-touran-typ-1t-2008-01-tol-els-tengely-terheles-1200kg-alatt-allithato-magassagu-futomu'),
(1619, '', '<p>Az MTS-Technik által készített sport futóművek ideális választás azok számára, akik kiemelten fontosnak tartják a kiváló minőséget és a versenyképes árakat. Ezek az állítható magasságú futóművek lehetővé teszik az autó alvázának könnyed beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei kiemelkedő egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p> <p><u>Főbb jellemzők:</u></p> <ul> <li>A futóművek rugóit az Eibach cég gyártja</li> <li>A magasság széles skálán, általában 25 és 80 mm között állítható</li> <li>Gáztöltésű lengéscsillapítók biztosítják a hatékony működést extrém körülmények között is</li> <li>Két rétegű bevonattal rendelkeznek a hosszú távú korrózióvédelem érdekében</li> <li>A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással</li> <li>A készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li> </ul> <p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Touran (Typ: 1T), 2003.03-tól, (első tengely terhelés 1106-1190kg) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-touran-typ-1t-2003-03-tol-els-tengely-terheles-1106-1190kg-allithato-magassagu-futomu'),
(1620, '', '<strong>Audi A3 MTS-Technik állítható magasságú sport futómű</strong></p>  <p>Ez a termék megfelel az alábbi típusokhoz:</p>  <ul> 	<li><strong>Audi A3 (Typ: 8P),</strong> 1.2TSI-től 3.2 V6 Quattro-ig</li> 	<li><strong>Audi A3 Sportback (Typ: 8P),</strong> 1.2TSI-től S3 Quattro-ig</li> 	<li><strong>Audi A3 Cabrio (Typ: 8P),</strong> 1.2TSI-től 2.0TDI-ig</li> 	<li>Első tengely terhelés: 1035kg</li> 	<li>Hátsó tengely terhelés: 1150kg</li> 	<li>Első lengéscsillapító szár átmérője: 50/55mm</li> 	<li>Ültetés mértéke elöl: 35-70mm</li> 	<li>Ültetés mértéke hátul: 35-60mm</li> 	<li>TÜV engedéllyel rendelkezik</li> 	<li>Figyelem! Rövidített stabilizátor rúd használata ajánlott! (a készlet nem tartalmazza)</li> </ul>  <p>A MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és a kedvező ár. Az állítható magasság lehetővé teszi az autó hasmagasságának könnyű beállítását az útviszonyoknak megfelelően. Az MTS-Technik futóművei optimális egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>a futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>a magasság fokozatmentesen állítható általában 25 és 80 mm között</li> 	<li>gáztöltésű lengéscsillapítók</li> 	<li>kiemelkedő hatékonyság extrém igénybevételek esetén is</li> 	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anodyzált alumínium alkatrészek)</li> 	<li>tökéletes összhang a rugók és a lengéscsillapítók között</li> 	<li>a készlet plug & play, nem igényel módosítást az autó felfüggesztésén</li> </ul>  <p><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></p> ', 'MTS-Technik by Nord Performance Volkswagen Touran (Typ: 1T), 2003.03-tól, (első tengely terhelés 1105kg alatt) állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-touran-typ-1t-2003-03-tol-els-tengely-terheles-1105kg-alatt-allithato-magassagu-futomu'),
(1621, '', '<div><span>Az Ap futómű olyan lehetőséget kínál a sportosan ambiciózus vezetőknek, hogy pontosan beállíthassák az általuk kívánt üléspozíciót. A sportos irányíthatóságot és optimális vezetési viselkedést ötvözzük a maximális üléspozícióval.</span></div> <div><span>Egy alumínium rugótányér segítségével lehetséges a jármű magasságának egyedi beállítása a TÜV által engedélyezett tartományon belül. A sportosság, kényelem és biztonság harmonikus egyensúlyban van, ami optimális szerkezetet biztosít.</span></div> <ul>     <li><span>kiváló minőségű termékek elérhető áron</span></li>     <li><span>egyedi magasságbeállítás a TÜV által engedélyezett határok között</span></li>     <li><span>kiváló minőségű alkatrészek és TÜV tanúsítvány</span></li>     <li><span>kivételes ár-érték arány</span></li>     <li><span>német minőségű termékek</span></li> </ul>', 'AP made by KW Volkswagen Touran (Typ: 1T), 2003.02-től, (első tengely terhelés 1060kg alatt), AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-touran-typ-1t-2003-02-tol-els-tengely-terheles-1060kg-alatt-ap-allithato-magassagu-futomu'),
(1622, '', '<div>Az Ap futómű lehetővé teszi a sportosan ambiciózus vezető számára, hogy a kívánt ültetést milliméter pontossággal beállítsa. A sportos irányíthatóságot és optimális vezetési viselkedést kombináljuk a maximális ültetéssel.</div> <div>Egy alumínium rugótányér segítségével a járműmagasságot egyénileg beállíthatjuk a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság egyidejű összehangolása optimális felépítést eredményez.</div> <ul> <li>kiváló minőség megfizethető áron</li> <li>egyedi magasságbeállítás a TÜV által engedélyezett tartományban</li> <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li> <li>egyedülálló ár/érték arány</li> <li>német minőség</li> </ul>', 'AP made by KW Volkswagen Touran (Typ: 1T), 2003.02-től, (első tengely terhelés 1061-1200kg-ig), AP állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-touran-typ-1t-2003-02-tol-els-tengely-terheles-1061-1200kg-ig-ap-allithato-magassagu-futomu'),
(1623, '', '<p>A Vogtland állítható magasságú futómű készlet a VOLKSWAGEN TOURAN modellekhez készült. Az évjárattól függően 35-70 mm-es ültetést tesz lehetővé. Ez a készlet speciálisan a Volkswagen Touran típusra lett tervezve, ahol az első tengely terhelése több mint 1060 kg, a lengéscsillapító ház átmérője pedig 55 mm. Az elülső tengely max. terhelése 1200 kg, míg a hátsó tengelyé 1160 kg. A futómű engedélyezett és TÜV minősítéssel rendelkezik. A készlet tartalmazza a rugókat és a lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és dinamikát biztosítanak alacsony nyomású gázrendszerüknek köszönhetően. Az első osztályú korrózióvédelemmel rendelkező lengéscsillapítók hozzájárulnak az autó megjelenésének javításához és a maximális vezetési élményhez. A gyártó cég 2 év garanciát vállal az ültetőrugókra és a lengéscsillapítókra, akik több mint 100 éves tapasztalattal rendelkeznek a rugógyártás területén. A készlet alapvetően 4 db ültető rugóból és 4 db lengéscsillapítóból áll, kivéve azokat az autótípusokat, amelyek szintezős vagy torziós futóművel vannak felszerelve. A termék Made in Germany! Cikkszám: 968993</p>', 'Vogtland  Volkswagen Touran (Typ: 1T), 2003.02-től, (első tengely terhelés 1061kg fölött) állítható magasságú futómű', '', '', '', 'vogtland--volkswagen-touran-typ-1t-2003-02-tol-els-tengely-terheles-1061kg-folott-allithato-magassagu-futomu'),
(1624, '', '<strong>Állítható magasságú futómű szett a Vogtlandtól: VOLKSWAGEN TOURAN</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2003.02-től</li>\n	<li><strong>Ültetés mértéke:</strong> 35 - 70 / 35 - 70 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Touran, Typ 1T, az első tengely terhelése legfeljebb 1060 kg, a lengéscsillapító ház átmérője 55 mm</li>\n	<li><strong>Max. tengelyterhelés elöl</strong>: 1060 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1160 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"http://shop.vogtland.com/media/pdf/ga7-172098-Vogtland-GFW800GF28-29_1547-10.pdf\" target=\"_blank\">ga7-172098-Vogtland-GFW800GF28-29_1547-10.pdf</a></li>\n</ul>\n<p>A Vogtland állítható magasságú futómű szettje nemcsak esztétikailag javítja az autó megjelenését, hanem optimális vezetési élményt is nyújt. A futómű szett tartalmazza a speciális, nagy teljesítményű kétcsöves lengéscsillapítókat, amelyek kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak az alacsony nyomású gázrendszernek köszönhetően. Az első osztályú korrózióvédelemmel ellátott lengéscsillapítók biztosítják a tartósságot.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, amely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyeknél szintező vagy torziós futóművet használnak.</p>\n<p>Gyártva Németországban!</p>\n<p>Cikkszám: 968992</p>', 'Vogtland Volkswagen Touran (Typ: 1T), 2003.02-től, (első tengely terhelés 1060kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-touran-typ-1t-2003-02-tol-els-tengely-terheles-1060kg-alatt-allithato-magassagu-futomu'),
(1625, '', '<p>Egy olyan futómű, melyet az MTS-Technik készített, és lehetőséget ad az állítható magasságra, ideális választás lehet a Volkswagen Passat B8 Variant tulajdonosai számára. Ennek a futóműnek a beállítása fokozatmentesen módosítható, így könnyedén alkalmazkodhat az útviszonyokhoz. Az MTS-Technik futóműveiben a rugók és a lengéscsillapítók optimális egyensúlyban vannak.</p>\n\n<p><u>Termékjellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az Eibach gyártja</li>\n	<li>A magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>Gáztöltésű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém körülmények között is</li>\n	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang a rugók és a lengéscsillapítók között</li>\n	<li>A készlet könnyen beszerelhető, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n\n<p><em>Weboldal tartalmának és képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Touran (Typ: 5T), 2015.05-től, (első tengely terhelés 1101-1200kg), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-touran-typ-5t-2015-05-tol-els-tengely-terheles-1101-1200kg-street-series-allithato-magassagu-futomu'),
(1626, '', '<p>Egy olyan sport futómű, amelyet az MTS-Technik készített, és melynek magassága fokozatmentesen állítható. Ez a termék kifejezetten a Volkswagen Passat B8 Variant modellekhez készült, beleértve a különböző motorváltozatokat és tengelyterheléseket. Fontos megjegyezni, hogy jelenleg nincs TÜV engedélye, de az engedélyeztetés folyamatban van. Az MTS-Technik futóművei ideális választások azoknak, akik minőségi és megfizethető termékeket keresnek, valamint könnyedén szeretnék az autó hasmagasságát az útviszonyokhoz igazítani. A futóművek rugóit az Eibach gyártja, és a magasság széles skálán állítható. Emellett gáztöltésű lengéscsillapítókat tartalmaznak, és kiváló hatékonyságot biztosítanak extrém igénybevétel mellett is. A bevonatoknak köszönhetően hosszú távú korrózióvédelmet nyújtanak. Az összhang a rugók és a lengéscsillapítók között tökéletes, és a készlet könnyen telepíthető, módosítások nélkül.</p> \n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Touran (Typ: 5T), 2015.05-től, (első tengely terhelés 1100kg alatt), Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-touran-typ-5t-2015-05-tol-els-tengely-terheles-1100kg-alatt-street-series-allithato-magassagu-futomu'),
(1627, '', '<p>Egy olyan sport futómű, melyet könnyedén beállíthat az útviszonyoknak megfelelően, ideális választás lehet azok számára, akik fontosnak tartják a minőséget és az ár-érték arányt. Az MTS-Technik állítható futóművei a rugók és a lengéscsillapítók optimális egyensúlyát biztosítják.</p>\n\n<p><u>Alkalmas a következő típusokhoz:</u></p>\n\n<ul>\n	<li><strong>Volkswagen Caddy T3, kivéve Syncro</strong></li>\n</ul>\n\n<p><u>Főbb jellemzők:</u></p>\n\n<ul>\n	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li>A magasság fokozatmentesen állítható, legtöbb esetben 25 és 80 mm között</li>\n	<li>Gáztöltetű lengéscsillapítók</li>\n	<li>Magas hatékonyság extrém igénybevétel mellett is</li>\n	<li>Két rétegű bevonat a hosszan tartó korrózióvédelem érdekében</li>\n	<li>Tökéletes összhang rugó és lengéscsillapító között</li>\n	<li>A készlet plug & play, nem igényel módosítást az autó felfüggesztésében</li>\n</ul>\n\n<p><u><strong>Termék jellemzői:</strong></u></p>\n\n<p><u><strong><img alt=\\\"\\\" src=\\\"https://www.futomushop.hu/images/streetmts.jpg\\\" /></strong></u></p>\n\n<p><em>A weboldal szöveges tartalmainak, képeinek engedély nélküli másolása, sokszorosítása tilos!</em></p>', 'MTS-Technik by Nord Performance Volkswagen Transporter T3, kivéve Syncro, 1979-1992-ig, Street Series állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-transporter-t3-kiveve-syncro-1979-1992-ig-street-series-allithato-magassagu-futomu'),
(1628, '', '<p><strong>Volkswagen Transporter T4 JOM BLUE LINE állítható magasságú futómű</strong></p>\n\n<ul>\n	<li>Típuskód: T4</li>\n	<li>Évjárat: 1991 - 2003</li>\n	<li>A készlet nem tartalmaz első rugót! Az első tengelyen ez a típus torziós rugóval van felszerelve.</li>\n	<li>A hátsó tengelynél a magasságállító a rugó felett található.</li>\n	<li>Tengelyterhelés elöl: 1600 kg</li>\n	<li>Tengelyterhelés hátul: 1490 kg</li>\n</ul>\n\n<ul>\n</ul>\n\n<ul>\n	<li>Gyártva Németországban</li>\n	<li>Ez a futómű rendelkezik német nyelvű TÜV engedéllyel, amelyet a csomag tartalmaz.</li>\n	<li>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</li>\n	<li>Az ültetés mértéke -4 cm és -12 cm között állítható egy állító kulccsal!</li>\n	<li>Kiemelkedő minőség, rendkívül kedvező áron!!!</li>\n	<li>A készlet tartalmaz 4 db lengéscsillapítót, 2 db hátsó rugót (a hozzá tartozó magasságállítóval) és az állításhoz szükséges 1 db kulcsot.</li>\n</ul>', 'Jom Bochum Volkswagen Transporter T4, 1991-2003-ig, Blue Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-transporter-t4-1991-2003-ig-blue-line-allithato-magassagu-futomu'),
(1629, '', '<strong>Volkswagen Transporter T4 FK Automotive állítható magasságú futómű</strong></p>\\r\\n\\r\\n<p>Az FK Automotive által gyártott állítható magasságú futóművet speciálisan tervezték a Volkswagen Transporter T4 típusú járműveihez, melyek gyártási éve 1990 és 2003 közötti időszakra esik. Fontos tudni, hogy a szett nem tartalmaz első rugót, mivel az első tengelyen torziós rugóval van ellátva. A hátsó tengelyen található magasságállító a rugó felett helyezkedik el, biztosítva ezzel a rugós rendszer optimális működését. A futómű előírt tengelyterhelése elöl 1600 kg, míg hátul 1470 kg. A termék \"MADE IN GERMANY\" minőségi garanciát jelent, valamint rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz. Emellett 1 ÉV TELJESKÖRŰ GARANCIÁVAL rendelkezik, így biztos lehet benne, hogy hosszú távon megbízható teljesítményt nyújt. Ne hagyja ki ezt a kiváló minőségű futóművet, amely rendkívül versenyképes áron kapható!</p>\\r\\n', 'FK-Automotive Volkswagen Transporter T4, 1990-2003-ig állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-transporter-t4-1990-2003-ig-allithato-magassagu-futomu'),
(1630, '', '<strong>MTS-Technik állítható magasságú sport futómű</strong></p>  <p>Az MTS-Technik állítható magasságú sport futóművei ideális választás azoknak, akik számára fontos a kiváló minőség és az előnyös ár! Az autó hasmagassága könnyedén beállítható az útviszonyoknak megfelelően, mivel fokozatmentesen állítható magassággal rendelkeznek. Az MTS-Technik futóművei tökéletes egyensúlyt teremtenek a rugók és a lengéscsillapítók között.</p>  <p><u>Termékjellemzők:</u></p>  <ul> 	<li>A futóművek rugóit az <strong>Eibach</strong> gyártja</li> 	<li>A magasság állítható legtöbbször 25 és 80 mm között</li> 	<li>Gáztöltésű lengéscsillapítók</li> 	<li>Kiemelkedő hatékonyság extrém körülmények között is</li> 	<li>Két rétegű bevonat a hosszantartó korrózióvédelem érdekében</li> 	<li>A rugók és a lengéscsillapítók tökéletes összhangban vannak egymással</li> 	<li>A készlet könnyen telepíthető, nem szükséges módosítani az autó felfüggesztésén</li> </ul> ', 'MTS-Technik by Nord Performance Volkswagen Transporter T4, 1990-2003-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-transporter-t4-1990-2003-ig-allithato-magassagu-futomu'),
(1631, '', '<strong>Volkswagen Transporter T5 JOM BLue Line állítható magasságú futómű</strong></p>\\r\\n\\r\\n<p> </p>\\r\\n\\r\\n<p>Az alkatrész kompatibilis a következő Volkswagen Transporter T5 modellekkel:</p>\\r\\n\\r\\n<p>2.0, 3.2 V6, 1.9TDi, 2.0TDi / BiTDi, 2.5TDi</p>\\r\\n\\r\\n<p>Az alkatrész megfelel az alábbi típuskódoknak: T5, 7HM, 7HMA, 7HC, 7HCA, 7HK, 7HKXO, 7JO</p>\\r\\n\\r\\n<p>Évjárat: 2003-2015</p>\\r\\n\\r\\n<p>A futómű hátsó tengelyén a magasságállító a rugó alatt található.</p>\\r\\n\\r\\n<p>Elülső tengely terhelése: 1710 kg</p>\\r\\n\\r\\n<p>Hátsó tengely terhelése: 1720 kg</p>\\r\\n\\r\\n<p>GYÁRTVA NÉMETORSZÁGBAN</p>\\r\\n\\r\\n<p>A futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJES KÖRŰ GARANCIÁVAL!!!</p>', 'Jom Bochum Volkswagen Transporter T5, csak 4-Motion, 2003-2015-ig állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-transporter-t5-csak-4-motion-2003-2015-ig-allithato-magassagu-futomu'),
(1632, '', '<strong>Volkswagen Transporter T5 JOM BLue Line állítható magasságú futómű</strong></p>\\r\\n\\r\\n<p>Az alkatrész kompatibilis az alábbi VW Transporter T5 típusokkal:</p>\\r\\n\\r\\n<p>VW Transporter T5 2.0, 3.2 V6, 1.9TDi, 2.0TDi / BiTDi, 2.5TDi</p>\\r\\n\\r\\n<p>Az alkatrész használható az alábbi típuskódokkal rendelkező autókhoz: T5, 7HM, 7HMA, 7HC, 7HCA, 7HK, 7HKXO, 7JO</p>\\r\\n\\r\\n<p>A futómű megfelel az 2003-2015 közötti években gyártott autókhoz.</p>\\r\\n\\r\\n<p>A magasságállító a hátsó tengelynél a rugó alatt található.</p>\\r\\n\\r\\n<p>A futómű terhelhetősége elöl: 1710 kg, hátsó tengelynél: 1720 kg.</p>\\r\\n\\r\\n<p>A termék MADE IN GERMANY.</p>\\r\\n\\r\\n<p>A futómű rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolás tartalmaz.</p>\\r\\n\\r\\n<p>2 ÉV TELJESKÖRŰ GARANCIÁVAL!!!</p>', 'Jom Bochum Volkswagen Transporter T5, 2.0, 3.2 V6, 1.9TDi, 2.0TDi, BiTDi, 2.5TDi, 2003-2015-ig, (első tengely terhelés 1710kg alatt), Blue-Line állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-transporter-t5-2-0-3-2-v6-1-9tdi-2-0tdi-bitdi-2-5tdi-2003-2015-ig-els-tengely-terheles-1710kg-alatt-blue-line-allithato-magassagu-futomu'),
(1633, '', '<strong>Volkswagen Transporter T5 FK Automotive állítható magasságú futómű</strong></p>\\r\\n\\r\\n<p>A Volkswagen Transporter T5 FK Automotive futóműve állítható magasságú, és tökéletes választás a T5 típusú járművekhez, mint például a 7HM, 7HMA, 7HC, 7HCA, 7HK, 7HKXO, 7JO modellekhez, melyek gyártása 2003-tól kezdődött.</p>\\r\\n\\r\\n<p>A futómű hátsó tengelyén a magasságállító a rugó alatt található meg, biztosítva ezzel a megfelelő stabilitást és teljesítményt. Az első tengely terhelése 1710 kg, míg a hátsó tengely terhelése 1720 kg.</p>\\r\\n\\r\\n<p>Ez a minőségi futómű MADE IN GERMANY, és rendelkezik német nyelvű TÜV engedéllyel, mely garancia a termék megbízhatóságára. A csomagolás tartalmazza az engedélyt.</p>\\r\\n\\r\\n<p>A Volkswagen Transporter T5 FK Automotive állítható magasságú futóműve 1 ÉV TELJESKÖRŰ GARANCIÁVAL kapható, így biztos lehet benne, hogy hosszú távon is kiválóan fog teljesíteni.</p>', 'FK-Automotive Volkswagen Tarnsporter T5, 2003.04-2015.08-ig, (első tengely terhelés 1710kg alatt) állítható magasságú futómű', '', '', '', 'fk-automotive-volkswagen-tarnsporter-t5-2003-04-2015-08-ig-els-tengely-terheles-1710kg-alatt-allithato-magassagu-futomu'),
(1634, '', '<strong>V-Maxx által gyártott egyedi futómű a Volkswagen Transporter T5-höz</strong><br />A futómű Hollandiában készül<br />Nem kompatibilis a T32 modellel<br />Az első tengely legnagyobb terhelhetősége 1680kg<br />Az elülső ültetési tartomány 45 - 75mm között állítható<br />A hátsó ültetési tartomány 40 - 70mm között változtatható<br />A futómű rendelkezik TÜV engedéllyel.', 'V-Maxx Volkswagen Transporter T5, 1.9TDi DSG, 2.0 DSG, 2.5TDi, 3.2 V6, beleértve 4-Motion, kivéve T32, 2003-tól, (első tengely terhelés 1680kg), állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-transporter-t5-1-9tdi-dsg-2-0-dsg-2-5tdi-3-2-v6-beleertve-4-motion-kiveve-t32-2003-tol-els-tengely-terheles-1680kg-allithato-kemenysegu-allithato-magassagu-futomu'),
(1635, '', '<div> <p>Ez a AP-Fahrwerke Állítható magasságú futómű tökéletesen illeszkedik a következő autótípushoz:</p>  <ul> 	<li>VW T5 Bus T5, Transporter, Első kerékhajtás, 4motion, Beleértve: Facelift</li> 	<li>Tipuskód: 7HC,7HCA,7HM,7HMA,7HK,7J0,7HKX0</li> 	<li>Típus variáció:</li> 	<li>Évjárat: 2003.01-től</li> 	<li>Tengelyterhelés elöl (kg): 1710</li> 	<li>Tengelyterhelés hátul (kg): 1720</li> 	<li>Egyéb kitételek: -</li> </ul>  <ul> 	<li>Ez a futómű örömmel büszkélkedhet Német nyelvű TÜV engedéllyel!</li> 	<li>Az engedélyben szereplő ültetés mértéke elöl: 35-65 mm, hátul: 30-65 mm között állítható<br /> 	(A futómű ennél nagyobb intervallumban is állítható, de a TÜV engedély csak a fent említett beállításokat ismeri el.)</li> 	<li>Extra ültetési lehetőség elöl: +20 mm, hátul: +5 mm</li> </ul>  <ul> 	<li>Gyártva Ap-Fahrwerke Németországban</li> 	<li>Garancia időtartama: 2 év</li> </ul>  <p><strong>Cikkszáma: GF80-040</strong></p>  <p><br /> Az ár egy szettre vonatkozik!</p> </div>', 'AP made by KW Volkswagen Transporter T5, 2003-tól állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-transporter-t5-2003-tol-allithato-magassagu-futomu'),
(1636, '', '<strong>Vogtland</strong> állítható magasságú futómű szett: VOLKSWAGEN T6</p>  \n<ul>\n	<li><strong>Évjárat</strong>: 2003.04-2015.08-ig</li> 	\n	<li><strong>Ültetés mértéke:</strong> 35 - 65/ 30 - 65 mm</li> 	\n	<li><strong>Típus</strong>: Volkswagen Tarnsporter T5</li> 	\n	<li><strong>Max. tengelyterhelés elõl</strong>: 1710 kg</li> 	\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1720 kg</li> 	\n	<li><strong>Engedély</strong>: <a href=\"https://www.vogtland.com/_gutachten/1AM80040.pdf\">https://www.vogtland.com/_gutachten/1AM80040.pdf</a></li> \n</ul>  \n<p>Az autó megjelenésének javítása mellett a Vogtland futómű szett maximális vezetési élményt nyújt. Az ültetés mértékét az egyéni igények szerint állíthatja be. A futómű speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel biztosítják a kiegyensúlyozott komfortot és fokozott dinamikát. A lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>  \n<p>A termék rendelkezik TÜV minősítéssel. A Vogtland, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás területén, 2 év garanciát vállal az ültető rugókra és lengéscsillapítókra.</p>  \n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyek szintezős vagy torziós futóművel vannak felszerelve.</p>  \n<p>Made in Germany!</p> ', 'Vogtland Volkswagen Tarnsporter T5, 2003.04-2015.08-ig, (első tengely terhelés 1710kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-tarnsporter-t5-2003-04-2015-08-ig-els-tengely-terheles-1710kg-alatt-allithato-magassagu-futomu'),
(1637, '', '<ul>\n	<li><strong>Volkswagen Transporter T6 JOM Blueline állítható magasságú futómű</strong></li>\n	<li>Modellszám: 7HC, 7HCA, 7HM, 7HMA, 7HK, 7J0, 7HKX0</li>\n	<li>4-Motion rendszerrel</li>\n	<li>Gyártási év: 2015.04-től</li>\n	<li>Elülső tengely terhelése: 1710 kg</li>\n	<li>Hátsó tengely terhelése: 1720 kg</li>\n	<li>Az ülésmagasság állítható elöl 45-70 mm, hátul 45-70 mm között<br />(A futómű más intervallumokban is állítható, de a TÜV engedélyezése csak az említett beállításokra vonatkozik.)</li>\n</ul>', 'Jom Bochum Volkswagen Transporter T6 (Typ: 7HM, 7HC, 7HK, 7HKXO), 2015-től, (első tengely terhelés 1710kg alatt) állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-transporter-t6-typ-7hm-7hc-7hk-7hkxo-2015-tol-els-tengely-terheles-1710kg-alatt-allithato-magassagu-futomu'),
(1638, '', '<strong>Volkswagen Transporter T6 FK Automotive állítható magasságú futómű</strong></p>\\r\\n\\r\\n<p>Az FK Automotive által kifejlesztett Volkswagen Transporter T6 típusú futóműve ideális választás a 2015-től gyártott modellekhez. Ennek a futóműnek a hátsó tengelyén elhelyezett magasságállító lehetővé teszi a rugó alatti elhelyezést, ami garantálja a rugalmas és kényelmes vezetési élményt. Az elöl 1750 kg, míg hátul 1720 kg tengelyterhelés lehetősége biztosítja a stabil és biztonságos közlekedést. Természetesen, mint minden FK Automotive termék, ez a futómű is MADE IN GERMANY minőséget képvisel, és rendelkezik a német nyelvű TÜV engedéllyel, melyet a csomagolásban megtalál. Emellett 1 ÉV TELJESKÖRŰ GARANCIÁVAL kapható, így maximális védelmet biztosít vásárlói számára.</p>', 'FK-Automotive  Volkswagen Tarnsporter T6, 2015.04-től, (első tengely terhelés 1710kg alatt) állítható magasságú futómű', '', '', '', 'fk-automotive--volkswagen-tarnsporter-t6-2015-04-tol-els-tengely-terheles-1710kg-alatt-allithato-magassagu-futomu'),
(1639, '', '<strong>Volkswagen Transporter T6 állítható magasságú futómű</strong><br /><ul><br /><li>A Volkswagen Transporter T6 (Typ: 7H, 7J) típusú járműveihez</li><br /><li>Ez a futómű kizárólag a Facelift modellekhez alkalmas</li><br /><li>Gyártási év: 2015.07-től</li><br /><li>Az alkalmazható motorok: 2.0, 2.0TDi , 75kW alatti teljesítmény</li><br /><li>Az 4-Motion rendszerrel kompatibilis</li><br /><li>Nem használható T32 és DSG modellekhez</li><br /><li>Az első tengely maximális terhelése 1680kg</li><br /><li>Az ültetés mértéke elöl: 45-75mm</li><br /><li>Az ültetés mértéke hátul: 40-70mm</li><br /><li>Áll rendelkezésre 24 hónapos garancia</li><br /><li>A futómű TÜV engedéllyel rendelkezik</li><br /></ul><br /><p>Telepítési útmutató elérhető itt: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/139.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/139.pdf</a></p><br /><p>TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20VW%2025.pdf\\\">https://www.v-maxx.com/files/TUV/70%20VW%2025.pdf</a></p>', 'V-Maxx Volkswagen Transporter T6, 2.0, 2.0TDi, 75kW alatt, beleértve 4-Motion, kivéve T32, DSG, 2015.07-től, (első tengely terhelés 1680kg alatt), állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-transporter-t6-2-0-2-0tdi-75kw-alatt-beleertve-4-motion-kiveve-t32-dsg-2015-07-tol-els-tengely-terheles-1680kg-alatt-allithato-kemenysegu-allithato-magassagu-futomu');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1640, '', '<strong>Volkswagen Transporter T6 állítható magasságú futómű</strong><br /><ul> <li>Autó: Volkswagen Transporter T6 (Típus: 7H, 7J)</li> <li>Megfelel az újított változatnak</li> <li>Gyártás éve: 2015.07-től</li> <li>Hajtómű: 2.0Tdi, 2.0TDi DSG, 2.0BiTDi, 85kW teljesítmény felett</li> <li>Tartalmazza a 4-Motion funkciót</li> <li>Nem alkalmazható T32 esetén</li> <li>Maximális első tengely terhelés: 1680kg</li> <li>Elülső ülésmagasság állítás: 45-75mm</li> <li>Hátsó ülésmagasság állítás: 40-70mm</li> <li>24 hónapos garancia jár a termékre</li> <li>A futómű TÜV engedéllyel rendelkezik</li> </ul><br /><p>Telepítési útmutató: <a href=\\\"https://www.v-maxx.com/files/INST.INSTRUCTIES/139.pdf\\\">https://www.v-maxx.com/files/INST.INSTRUCTIES/139.pdf</a></p><br /><p>TÜV engedély: <a href=\\\"https://www.v-maxx.com/files/TUV/70%20VW%2025.pdf\\\">https://www.v-maxx.com/files/TUV/70%20VW%2025.pdf</a></p>', 'V-Maxx Volkswagen Transporter T6, 2.0TDi, 2.0TDi DSG, 2.0BiTDi, 85kW fölött, beleértve 4-Motion, kivéve T32, 2015.07-től, (első tengely terhelés 1680kg alatt), állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-transporter-t6-2-0tdi-2-0tdi-dsg-2-0bitdi-85kw-folott-beleertve-4-motion-kiveve-t32-2015-07-tol-els-tengely-terheles-1680kg-alatt-allithato-kemenysegu-allithato-magassagu-fu'),
(1641, '', '<div> <p>Ez az AP-Fahrwerke Állítható magasságú futómû megfelel a következő autótípusnak:</p> <ul> <li>VW T5 Bus T5, Transporter, Első kerékhajtás, 4motion, Beleértve: Facelift</li> <li>Tipuskód: 7HC,7HCA,7HM,7HMA,7HK,7J0,7HKX0</li> <li>Típus variáció:</li> <li>Évjárat: 2003.01-től</li> <li>Tengelyterhelés elöl (kg): 1710</li> <li>Tengelyterhelés hátul (kg): 1720</li> <li>Egyéb kitételek: -</li> </ul> <ul> <li>Ez a futómű összeállítás rendelkezik Német nyelvű TÜV engedéllyel!</li> <li>Az engedélyben meghatározott ültetés mértéke elöl: 35-65 mm, hátul: 30-65 mm között módosítható (mindig nagyobb intervallumban állítható, de a TÜV engedély kizárólag ezen beállításokra vonatkozik.)</li> <li>Plusz ültetés lehetséges elöl: +20 mm, hátul: +5 mm</li> </ul> <ul> <li>Gyártva Ap-Fahrwerke Németországban</li> <li>2 év garancia a termékre</li> </ul> <p><strong>Cikkszám: GF80-040</strong></p> <p><br /> Az ár egy készletre vonatkozik!</p> </div>', 'AP made by KW Volkswagen Transporter T6, 2015.04-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-transporter-t6-2015-04-tol-allithato-magassagu-futomu'),
(1642, '', '<p>A Vogtland által készített állítható magasságú futómű szett, melyet a VOLKSWAGEN T6 modellekhez terveztek, a következő jellemzőkkel rendelkezik:</p>\n<ul>\n	<li><strong>Évjárat</strong>: 2003.04-2015.08-ig</li>\n	<li><strong>Ültetés mértéke:</strong> 35 - 65/ 30 - 65 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Tarnsporter T5</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 1710 kg</li>\n	<li><strong>Max. tengelyterhelés hátul</strong>: 1720 kg</li>\n	<li><strong>Engedély</strong>: <a href=\"https://www.vogtland.com/_gutachten/1AM80040.pdf\">https://www.vogtland.com/_gutachten/1AM80040.pdf</a></li>\n</ul>\n<p>A Vogtland futómű szett nemcsak esztétikailag javítja az autó megjelenését, hanapság vezetési élményt is garantál. A rugós és lengéscsillapító elemek kombinációjával szabályozható az ültetés mértéke az egyéni igényeknek megfelelően. A kiváló minőségű futómű szett speciális, nagy teljesítményű kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerrel rendelkeznek, ezzel biztosítva a kiegyensúlyozott komfortot és a fokozott dinamikát. Emellett a lengéscsillapítók korrózióvédelemmel rendelkeznek.</p>\n<p>A termék TÜV minősítéssel rendelkezik, és a gyártó cég, melynek több mint 100 éves tapasztalata van a rugógyártás területén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek szintezős vagy torziós futóművel rendelkeznek.</p>\n<p>Made in Germany!</p>', 'Vogtland Volkswagen Transporter T6 (Typ: 7HM, 7HC, 7HK, 7HKXO), 2015-től, (első tengely terhelés 1710kg alatt) állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-transporter-t6-typ-7hm-7hc-7hk-7hkxo-2015-tol-els-tengely-terheles-1710kg-alatt-allithato-magassagu-futomu'),
(1643, '', '<p>Egy olyan futómű, melyet a BILSTEIN mérnökei terveztek a Volkswagen Transporter T6 modellek számára, beleértve a 4-Motion és Multivan verziókat. Csak az elektronikus futómű szabályzással ellátott modellekhez ajánlott. A futómű BILSTEIN egycsöves rendszerrel és gáztöltetű technológiával rendelkezik. Egyszerűen állítható csillapítási erővel és Triple-C-Technology felületkezeléssel, mely hosszú távú korrózióvédelmet biztosít. A futómű Upside-Down technológiával és versenysportrugókkal, melyek állítható magasságot tesznek lehetővé alumíniumból készült rugótányér és kontra anya segítségével. A húzó és nyomófokozat egyidejűleg állítható, és rendelkezik TÜV minősítéssel.</p>\n<p>A B16 PSS9-es lengéscsillapítóhoz képest a jármű magassága az első és hátsó tengelyen maximum 50 mm-rel csökkenthető egy 20 mm-es állítási tartományon belül. Beépített állapotban 9 karakterisztika változtatható egy beállító kerék segítségével, biztosítva a jármű professzionális beállítását minden helyzetben.</p>\n<p>Elülső: 30-50mm állítási tartomány</p>\n<p>Hátsó: 30-50mm állítási tartomány</p>\n<p>Első tengely terhelés: 1710 kg</p>\n<p>Hátsó tengely terhelés: 1720 kg</p>', ' Volkswagen Transporter T6, beleértve 4-Motion és Multivan, csak elektronikus futómű szabályzással szerelt típusokhoz, 2015-től, Bilstein B16 Damptronic, állítható keménységű állítható magasságú futómű', '', '', '', '-volkswagen-transporter-t6-beleertve-4-motion-es-multivan-csak-elektronikus-futomu-szabalyzassal-szerelt-tipusokhoz-2015-tol-bilstein-b16-damptronic-allithato-kemenysegu-allithato-magassagu-f'),
(1644, '', '<p>Ez a JOM Blueline Állítható magasságú futóművet tervezték és gyártották a következő autótípushoz:</p>\n<ul>\n	<li>VW UP</li>\n	<li>Tipuskód: AA</li>\n	<li>Évjárat: 2011.12-től</li>\n	<li>Tengelyterhelés elöl (kg): 680</li>\n	<li>Tengelyterhelés hátul (kg): 640</li>\n	<li>Ez a futóműszett rendelkezik Német nyelvű TÜV engedéllyel!</li>\n	<li>Az engedélyben meghatározott ültetés mértéke elöl: 30-60 mm, hátul: 30-60 mm között állítható<br />\n	(Minden esetben ennél nagyobb intervallumban állítható a futómű, azonban a TÜV engedély csak a fent említett beállításokat fogadja el.)</li>\n</ul>', 'Jom Bochum Volkswagen UP (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-up-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(1645, '', '<strong>E-UP! V-Maxx állítható futómű Volkswagen gépjárművekhez</strong>\\n\\nGyártási év: 2013.09-től\\n\\nElülső ültetés mértéke: 30-60mm\\n\\nHátsó ültetés mértéke: 30-50mm\\n\\nFontos megjegyzés: Az alacsonyabb futómű beépítéséhez szükséges egy rövidebb stabilizátorrúd!\\n\\nTÜV minősítés: <a href=\\\\\\\"https://www.v-maxx.com/files/TUV/60%20VS%2015.pdf\\\\\\\">https://www.v-maxx.com/files/TUV/60%20VS%2015.pdf</a>', 'V-Maxx Volkswagen E-UP (Typ: AA/AAN), 2013.09-től állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-e-up-typ-aaaan-2013-09-tol-allithato-magassagu-futomu'),
(1646, '', '<strong>Volkswagen UP! V-Maxx futómű átállítása</strong><br />A Volkswagen UP! V-Maxx futóműve 2011 decemberétől került előállításra. Az elülső ültetés mértéke 30-60mm, míg a hátsó ültetés 30-50mm lehet. Fontos, hogy a futómű felszereléséhez rövidített stabilizátorrudat szükséges használni. A futómű átállítása TÜV engedéllyel rendelkezik, melynek részleteit a <a href=\\\"https://www.v-maxx.com/files/TUV/60%20VS%2014.pdf\\\">https://www.v-maxx.com/files/TUV/60%20VS%2014.pdf</a> linken találhatja.', 'V-Maxx Volkswagen UP (Typ: AA/AAN), kivéve E-UP, 2011.12-től állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-up-typ-aaaan-kiveve-e-up-2011-12-tol-allithato-magassagu-futomu'),
(1647, '', '<p>Ez a moduláris AP-Fahrwerke állítható magasságú futómű passzol a VW UP típusú autókhoz. A futómű német TÜV engedéllyel rendelkezik, és az engedélyben meghatározott ültetés mértéke elöl 30-60 mm, hátul 30-60 mm között állítható. Emellett lehetőség van további ültetésre elöl +20 mm, hátul +5 mm-el. A futóművet Németországban, az AP-Fahrwerke gyárában gyártották, és 2 év garancia vonatkozik rá. A cikkszáma: 1158000C. Az ár 1 szettre vonatkozik!</p>', 'AP made by KW Volkswagen UP (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-up-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(1648, '', '<p>A Vogtland által gyártott állítható magasságú futómű szett ideális választás a Volkswagen Up! modellekhez, típusként az AA modelleket támogatja 2011-től. A futómű kitűnően javítja az autó megjelenését, miközben maximális vezetési élményt nyújt. A szett lehetővé teszi az ültetés mértékének állítását 30-60 mm között, hogy személyre szabott legyen az autó beállítása. A készlet kétcsöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerük révén kiegyensúlyozott komfortot és fokozott dinamikát biztosítanak. A lengéscsillapítók kiváló korrózióvédelmet nyújtanak, így hosszú távon is optimális teljesítményt biztosítanak.</p>\n\n<p>A futómű TÜV minősítéssel rendelkezik, és a gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültetőrugókra és lengéscsillapítókra. A szett alapvetően 4 db ültetőrugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, amelyek másfajta futóművet használnak.</p>\n\n<p>Made in Germany!</p>\n<p>Cikkszám: 968733</p>', 'Vogtland  Volkswagen UP (Typ: AA), 2011.12-től állítható magasságú futómű', '', '', '', 'vogtland--volkswagen-up-typ-aa-2011-12-tol-allithato-magassagu-futomu'),
(1649, '', '<p>Egy állítható magasságú sport futómű, melyet a VW Golf 3 JOM BLUELINE modellekhez terveztek.</p>\\r\\n\\r\\n<p>Ez a futómű ideális választás az 1991.09 - 1997.09 között gyártott 1H / 1HXO / 1E / 1EXO típusú autókhoz, melyek esetében a tengelyterhelés elöl 955 kg, míg hátul 820 kg.</p>\\r\\n\\r\\n<p>Fontos tudni, hogy a Syncro és Variant modellekhez nem kompatibilis.</p>\\r\\n\\r\\n<p>A termék \"MADE IN GERMANY\" minőséget képvisel, valamint rendelkezik német nyelvű TÜV engedéllyel, melyet a csomagolásban találsz meg.</p>\\r\\n\\r\\n<p>A futóműre 2 év teljeskörű garancia vonatkozik, és lehetőség van az ültetés mértékének -4 cm és -12 cm közötti állítására egy állítókulccsal.</p>\\r\\n\\r\\n<p>A szett tartalmaz 4 db lengéscsillapítót rugókkal, valamint az állításhoz szükséges 1 db kulcsot.</p>\\r\\n\\r\\n<p>Cikkszám: 741000</p>', 'Jom Bochum Volkswagen Vento, 1991.09-1997.09-ig állítható magasságú futómű', '', '', '', 'jom-bochum-volkswagen-vento-1991-09-1997-09-ig-allithato-magassagu-futomu'),
(1650, '', '<div><strong style=\\\"font-family: OpenSans-Regular, sans-serif; box-sizing: border-box; color: rgb(135, 135, 135); font-size: 13.3333px;\\\">A Volkswagen Vento V-Maxx modellhez sport futómű állítható magassággal elérhető<br /> </strong>', 'V-Maxx Volkswagen Vento, 1991.09-1997.09-ig állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-vento-1991-09-1997-09-ig-allithato-magassagu-futomu'),
(1651, '', '<p><strong>MTS-Technik állítható magasságú sport futómű</strong></p>\n<ul>\n	<li><strong>Volkswagen Golf 3 Cabrio, </strong>1.6 / 1.8 / 1.9 TDI / 2.0</li>\n	<li><strong>Volkswagen Golf 4 Cabrio, </strong>1.6 / 1.8 / 1.9 TDI / 2.0</li>\n	<li>Ültetés mértéke elöl: 25-80mm</li>\n	<li>Ültetés mértéke hátul: 25-80m</li>\n	<li>Rugó erősség (első, fő rugó): 60 N/mm</li>\n	<li>Rugó erősség (első, segéd rugó): 20 N/mm</li>\n	<li>Rugó erősség (hátsó, fő rugó): 60 N/mm</li>\n	<li>Rugó erősség (hátsó, segéd rugó): 20 N/mm</li>\n</ul>\n\n<p>Az MTS-Technik által kifejlesztett állítható magasságú sport futóművek ideális választásnak bizonyulnak azok számára, akik számára fontos a kiváló minőség és az elérhető ár. Az útfelület állapotának megfelelően könnyedén beállítható az autó hasmagassága a fokozatmentesen állítható magasságnak köszönhetően. Az MTS-Technik futóműveiben optimális az egyensúly a rugók és a lengéscsillapítók között.</p>\n\n<p><u>Termékjellemzők:</u></p>\n<ul>\n	<li>az állítható magasságú futóművek rugóit az <strong>Eibach</strong> gyártja</li>\n	<li><strong>rendelkezik TÜV engedéllyel</strong></li>\n	<li>a magasság szabadon állítható általában 25 és 80 mm között</li>\n	<li>gáztöltésű lengéscsillapítók</li>\n	<li>kiemelkedő hatékonyság extrém igénybevétel esetén is</li>\n	<li>két rétegű bevonat a hosszú távú korrózióvédelem érdekében (sárga cink bevonat és fekete anódizált alumínium alkatrészek)</li>\n	<li>pontos egyensúly rugó és lengéscsillapító között</li>\n	<li>a készlet könnyen telepíthető, nem igényel módosítást az autó felfüggesztésén</li>\n</ul>\n\n<p><img alt=\"\" src=\"https://www.futomushop.hu/images/streetmts.jpg\" /></p>', 'MTS-Technik by Nord Performance Volkswagen Vento, 1992.09-1997.09-ig állítható magasságú futómű', '', '', '', 'mts-technik-by-nord-performance-volkswagen-vento-1992-09-1997-09-ig-allithato-magassagu-futomu'),
(1652, '', '<div>\n    <div><strong>Volkswagen Golf 3 AP KW által gyártott állítható magasságú futómű</strong></div>\n    \n    <ul>\n        <li>Első tengely terhelés: 891-980kg</li>\n        <li>Kivéve: Variant és Syncro</li>\n        <li>Letölthető dokumentumok: <strong><a href=\"https://www.ap.de/documents/gaAPGFW80-004_1095-11.pdf\"><span>TÜV engedély</span></a>, <a href=\"https://www.ap.de/documents/ea_ap_GF_80004.pdf\"><span>szerelési útmutató</span></a></strong></li>\n    </ul>\n    \n    <div>Az AP futómű lehetőséget biztosít a vezető számára, hogy a kívánt ültetést milliméterre beállítsa. A sportos irányíthatóság és optimális vezetési viselkedés kombinációját nyújtjuk maximális ültetéssel.</div>\n    \n    <div>Alumínium rugótányér segítségével a járműmagasság beállítható a TÜV által engedélyezett tartományban. A sportosság, kényelem és biztonság harmonikus összehangolása optimális felépítést eredményez.</div>\n    \n    <ul>\n        <li>kiváló minőség megfizethető áron</li>\n        <li>egyéni magasság beállítás a TÜV által engedélyezett tartományban</li>\n        <li>kiváló minőségű alkatrészek és TÜV tanúsítvány</li>\n        <li>egyedülálló ár/érték arány</li>\n        <li>német minőség</li>\n    </ul>\n</div>', 'AP made by KW Volkswagen Vento, 1991.09-1997.09-ig állítható magasságú futómű', '', '', '', 'ap-made-by-kw-volkswagen-vento-1991-09-1997-09-ig-allithato-magassagu-futomu'),
(1653, '', '<div>\\n  A Volkswagen Vento V-Maxx autóhoz készült sport futómű, melynek magassága és keménysége testreszabható.\\n</div>', 'V-Maxx Volkswagen Vento, 1991.09-1997.09-ig, 20 fokozatban állítható keménységű állítható magasságú futómű', '', '', '', 'v-maxx-volkswagen-vento-1991-09-1997-09-ig-20-fokozatban-allithato-kemenysegu-allithato-magassagu-futomu'),
(1654, '', '<p><strong>Vogtland</strong><span> állítható magasságú futómű szett</span>: VOLKSWAGEN GOLF 3</p>\n<ul>\n	<li><strong>Évjárat</strong>: 1992-1997</li>\n	<li><strong>Ültetés mértéke:</strong> 40 - 70 / 40 - 70 mm</li>\n	<li><strong>Típus</strong>: Volkswagen Golf III</li>\n	<li><strong>Kivéve:</strong> Syncro és Variant</li>\n	<li><strong>Max. tengelyterhelés elõl</strong>: 980 kg</li>\n	<li><strong>Max. tengelyterhelés hátu</strong>l: 880 kg</li>\n</ul>\n<p>Az autó megjelenésének javítása mellett teljes mértékben új vezetési élményt nyújt ez a futómű szett. Az ültetés mértékét a megfelelő értékekre állíthatja saját elképzelése szerint. Ez a kiváló minőségű futómű szett kizárólag speciális, magas teljesítményű két csöves lengéscsillapítókat tartalmaz, melyek alacsony nyomású gázrendszerüknek köszönhetően biztosítják a kiegyensúlyozott kényelmet és a fokozott dinamikát. A lengéscsillapítók kiváló korrózióvédelmet biztosítanak.</p>\n<p>A termék rendelkezik TÜV minősítéssel. A gyártó cég, mely több mint 100 éves tapasztalattal rendelkezik a rugógyártás terén, 2 év garanciát vállal az ültető rugókra és a lengéscsillapítókra!</p>\n<p>A szett alapvetően 4 db ültető rugót és 4 db lengéscsillapítót tartalmaz, kivéve azoknál az autótípusoknál, melyeknél szintezős vagy torziós futóművet alkalmaznak.</p>\n<p>Készült Németországban!</p>\n<p>Cikkszám: 968213</p>', 'Vogtland Volkswagen Vento, 1991.09-1997.09-ig állítható magasságú futómű', '', '', '', 'vogtland-volkswagen-vento-1991-09-1997-09-ig-allithato-magassagu-futomu'),
(1655, '', '<p>Egy olyan készlet, amely lehetővé teszi, hogy állítsd a stabilizátorrudat az igényeidnek megfelelően. Különféle méretekben elérhető, és a JOM Bochum által gyártott. Ideális választás állítható magasságú futóművekhez és fix magasságú sport futóművekhez vagy ültetőrugókhoz, különösen 40mm-t meghaladó ültetés esetén. A cikkszám: 740412. Hasznos kiegészítője lehet az autód futóművének, ha a gyári stabilizátorrúd nem bírja el a mélyebb ültetést. Kompatibilis a legtöbb autómárkával.</p>', 'Jom Bochum Audi A1 (Typ: 8X), 2010.05-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-audi-a1-typ-8x-2010-05-tol-allithato-stabilizator-keszlet'),
(1656, '', '<p>Egyedi hosszúságú stabilizátorrúd készlet</p>\\n<p>Gyártó: V-Maxx</p>\\n<p>Termék eredete: Hollandia</p>\\n<p>Kínált méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Részszám: SBMO</p>', 'V-Maxx Audi A1 (Typ: 8X), 2010.05-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-audi-a1-typ-8x-2010-05-tol-allithato-stabilizator-keszlet'),
(1657, '', '<p>Egy olyan készlet, amely lehetővé teszi a stabilizátorrúd állítását, kifejezetten ajánlott olyan autókhoz, amelyekhez állítható magasságú futóművet (gewinde) szereltek, valamint 40 mm-nél mélyebb ültetéshez fix magasságú sport futóművekhez vagy ültetőrugókhoz. Bizonyos esetekben a gyári stabilizátorrúd nem képes megbirkózni a 40 mm-nél mélyebb ültetéssel, ami kopogáshoz vezethet. Ennek a problémának a megoldására szolgál a JOM állítható stabilizátorrúd készlet. Kompatibilis a legtöbb autómárkával.</p>', 'Jom Bochum Audi A3 (Typ: 8P), 2003-2013-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-audi-a3-typ-8p-2003-2013-ig-allithato-stabilizator-keszlet'),
(1658, '', '<p>Egyedi állítható stabilizátorrúd készlet elérhető</p>\\n<p>A terméket a V-Maxx cég gyártja</p>\\n<p>Gyártási hely: Hollandia</p>\\n<pKapható méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>A termék cikkszáma: SBMO</p>', 'V-Maxx Audi A3 (Typ: 8P), 2003-2013-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-audi-a3-typ-8p-2003-2013-ig-allithato-stabilizator-keszlet'),
(1659, '', '<strong>Állítható stabilizátorrúd készlet</strong>\\n\\n<ul> \\n  <li>Gyártó: JOM Bochum</li> \\n  <li>Származási hely: Németország</li> \\n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li> \\n  <li>Cikkszám: 740412</li> \\n</ul>\\n\\n<p>Az <strong>állítható magasságú futóművek</strong> és a 40mm-nél magasabb ültetésű <strong>sport futóművek</strong> vagy <strong>ültetőrugók</strong> esetén kifejezetten ajánlott. Előfordulhat, hogy a gyári stabilizátorrúd nem képes megbirkózni a 40mm-nél mélyebb ültetéssel, ami kopogáshoz vezethet. Ennek kiküszöbölésére szolgál az <strong>állítható stabilizátorrúd készlet</strong> a JOM-tól. Kompatibilis számos autómárkával!</p>', 'Jom Bochum Audi A3 (Typ: 8V), 2012-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-audi-a3-typ-8v-2012-tol-allithato-stabilizator-keszlet'),
(1660, '', '<p>Állítható stabilizátorrúd készlet</p>\\n<p>A termék gyártója a V-Maxx vállalat</p>\\n<p>A készlet Hollandiában készült</p>\\n<p>A stabilizátorrudak méretei: 15-20cm, 22-27cm, 27-32cm között változnak</p>\\n<p>A cikkszám: SBMO</p>', 'V-Maxx Audi A3 (Typ: 8V), 2012-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-audi-a3-typ-8v-2012-tol-allithato-stabilizator-keszlet'),
(1661, '', '<p>Egy olyan termék, ami segít megoldani az állítható magasságú futóművek és fix magasságú sport futóművek problémáit. Ideális választás 40mm-t meghaladó ültetés esetén vagy ültetőrugókhoz. A JOM Bochum által gyártott állítható stabilizátor rúd készlet Made in Germany-ből származik és különböző méretű változatokban elérhető (15-20cm, 22-27cm, 27-32cm). A termék cikkszáma: 740412. Ez a készlet kompatibilis a legtöbb autómárkával, és segít elkerülni a gyári stabilizátor rúd kopását és zajos működését. Ajánlott választás a futóművek szakszerű beállításához!</p>', 'Jom Bochum Audi TT (Typ: 8J), 2006.08-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-audi-tt-typ-8j-2006-08-tol-allithato-stabilizator-keszlet'),
(1662, '', '<p>Állítható stabilizátorrúd szett</p>\\n<p>Gyártó: V-Maxx</p>\\n<p>Gyártási hely: Hollandia</p>\\n<p>Méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Cikkszám: SBMO</p>', 'V-Maxx Audi TT (Typ: 8J), 2006.08-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-audi-tt-typ-8j-2006-08-tol-allithato-stabilizator-keszlet'),
(1663, '', '<p>Egy olyan készlet, amely lehetővé teszi a stabilizátorrúd állítását, kifejezetten ajánlott állítható magasságú futóművekhez és fix magasságú sport futóművekhez vagy ültetőrugókhoz, amelyek 40mm-t meghaladják az ülésmagasságot. Bizonyos esetekben a gyári stabilizátorrúd nem képes kezelni ezt a mélységet, ami kopáshoz vezethet. A JOM által gyártott állítható stabilizátorrúd készlet ezt a problémát oldja meg, és kompatibilis számos márka termékeivel. A készlet méretei: 15-20cm, 22-27cm, 27-32cm. Gyártó: JOM Bochum, Made in Germany. Cikkszám: 740412.</p>', 'Jom Bochum Opel Astra G, 1998-2009-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-opel-astra-g-1998-2009-ig-allithato-stabilizator-keszlet'),
(1664, '', '<p><strong>MTS Technik állítható stabilizátor készlet</strong></p>\\r\\n\\r\\n<ul>\\r\\n	<li>A csomagban 2 db állítható stabilizátor rúd található (kutyacsont)</li>\\r\\n	<li>A termék ideális választás állítható magasságú futóművek esetén</li>\\r\\n	<li>2 év garanciával ellátva</li>\\r\\n</ul>\\r\\n', 'MTS-Technik by Nord Performance Opel Astra G, 1998-2009-ig, állítható stabilizátor készlet', '', '', '', 'mts-technik-by-nord-performance-opel-astra-g-1998-2009-ig-allithato-stabilizator-keszlet'),
(1665, '', '<p>Állítható stabilizátorrúd készlet</p>\\n<p>A gyártója a V-Maxx cég, mely Hollandiában található.</p>\\n<p>A készlet tartalmaz méreteket 15-20cm, 22-27cm és 27-32cm között.</p>\\n<p>A cikkszáma SBMO.</p>', 'V-Maxx Opel Astra G, 1998-2009-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-opel-astra-g-1998-2009-ig-allithato-stabilizator-keszlet'),
(1666, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\\n\\n<ul> \\n  <li>Gyártó: JOM Bochum</li> \\n  <li>Származási hely: Németország</li> \\n  <li>Elérhető Méretek: 15-20cm, 22-27cm, 27-32cm</li> \\n  <li>Cikkszám: 740412</li> \\n</ul>  \\n\\n<p>Az <strong>állítható magasságú futóművek</strong> és a 40mm-t meghaladó ültetés esetén alkalmazható <strong>fix magasságú sport futóművek</strong> vagy <strong>ültetőrugók</strong> esetében különösen ajánlott. Amikor a gyári stabilizátorrúd már nem képes elviselni a 40mm-től mélyebb ültetést, és kopogni kezd, a <strong>JOM által készített állítható stabilizátorrúd készlet</strong> segíthet ezen a problémán. Kompatibilis számos autómárkával!</p>  \\n\\n<p> </p>  ', 'Jom Bochum Opel Astra H, 2004-2010-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-opel-astra-h-2004-2010-ig-allithato-stabilizator-keszlet'),
(1667, '', '<div>\n    Állítható stabilizátorrúd készlet<br>\n    Gyártó: V-Maxx<br>\n    Gyártási hely: Hollandia<br>\n    Méretek: 15-20cm, 22-27cm, 27-32cm<br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Opel Astra H, 2004-2010-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-opel-astra-h-2004-2010-ig-allithato-stabilizator-keszlet'),
(1668, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\\n\\n<ul> \\n<li>Gyártó: JOM Bochum</li> \\n<li>Gyártási hely: Németország</li> \\n<li>Méretek: 15-20cm, 22-27cm, 27-32cm</li> \\n<li>Cikkszám: 740412</li> \\n</ul>  \\n\\n<p>Az <strong>állítható magasságú futómű</strong>vek és a 40mm-t feletti ültetésű <strong>fix magasságú sport futómű</strong>vek vagy <strong>ültetőrugó</strong>k használatakor különösen ajánlott. Előfordulhat, hogy a gyári stabilizátor rúd nem képes megbirkózni a 40mm-nél mélyebb ültetéssel, így kopogni kezd. Ezt a problémát hivatott megoldani a <strong>JOM állítható stabilizátor készlet</strong>, mely kompatibilis a legtöbb autómárkával.</p>  \\n\\n<p></p>', 'Jom Bochum Seat Altea (Typ: 5P), 2004-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-seat-altea-typ-5p-2004-tol-allithato-stabilizator-keszlet'),
(1669, '', '<p>Egy olyan készlet, amelyben állítható stabilizátorrudak találhatók.</p>\\n<p>A gyártója a V-Maxx, Hollandiában készült.</p>\\n<p>Az elkészült termék méretei: 15-20cm, 22-27cm, 27-32cm.</p>\\n<p>A cikkszáma: SBMO.</p>', 'V-Maxx  Seat Altea (Typ: 5P), 2004-től, állítható stabilizátor készlet', '', '', '', 'v-maxx--seat-altea-typ-5p-2004-tol-allithato-stabilizator-keszlet'),
(1670, '', '<p>Egy olyan termék, amely megoldást nyújt a jármű állítható magasságú futóműveihez és ültetőrugóihoz. Elengedhetetlen kiegészítője az autó tuningjának, különösen akkor, ha a gyári alkatrészek nem képesek a mélyebb ültetésre. A JOM Bochum által gyártott, Németországban készült stabilizátor rúd készlet számos márkával kompatibilis. A termék különböző méretekben érhető el, így megfelel az 15-20cm, 22-27cm és 27-32cm közötti igényeknek. A cikkszám: 740412.</p>', 'Jom Bochum Seat Cordoba (Typ: 6L), 2002-2008-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-seat-cordoba-typ-6l-2002-2008-ig-allithato-stabilizator-keszlet'),
(1671, '', '<p>Egy olyan készlet, amely állítható stabilizátorrudakat tartalmaz, melyet a V-Maxx gyárt. A termék Hollandiában készült. Különböző méretekben érhető el: 15-20cm, 22-27cm, 27-32cm. A termék cikkszáma: SBMO.</p>', 'V-Maxx Seat Cordoba (Typ: 6L), 2002-2008-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-seat-cordoba-typ-6l-2002-2008-ig-allithato-stabilizator-keszlet'),
(1672, '', '<strong>Állítható stabilizátorrúd készlet részletei</strong>\n\n<ul>\n  <li>Gyártó: JOM Bochum</li>\n  <li>Gyártási hely: Németország</li>\n  <li>Elérhető méretek: 15-20cm, 22-27cm, 27-32cm</li>\n  <li>Cikkszám: 740412</li>\n</ul>\n\n<p>Az <strong>állítható magasságú futóművekhez</strong> és a 40mm-t meghaladó <strong>ültetéshez</strong> ajánlott a <strong>JOM állítható stabilizátorrúd készlet</strong>. Amennyiben a jármű ültetése meghaladja a 40mm-t, és a gyári stabilizátorrúd nem elegendő, akkor ez a készlet segíthet a kopogások kiküszöbölésében. Nagyon sok autómárkához kompatibilis megoldás!</p>', 'Jom Bochum Seat Ibiza (Typ: 6J), 2008.06-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-seat-ibiza-typ-6j-2008-06-tol-allithato-stabilizator-keszlet'),
(1673, '', '<p>Állítható stabilizátorrudak elérhetők</p>\\n<p>A termék gyártója a V-Maxx</p>\\n<p>Gyártási hely: Hollandia</p>\\n<p>Kapható méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Cikkszám: SBMO</p>', 'V-Maxx Seat Ibiza (Typ: 6J), 2008.06-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-seat-ibiza-typ-6j-2008-06-tol-allithato-stabilizator-keszlet'),
(1674, '', '<p>Egy olyan készlet, amely lehetővé teszi az állítható stabilizátorrudak könnyű beállítását és használatát. A JOM Bochum által gyártottak, Németországban készültek. Elérhető méretek: 15-20cm, 22-27cm, 27-32cm. Cikkszám: 740412.</p>\n\n<p>Ezek az állítható stabilizátorrudak ideálisak az állítható magasságú futóművekhez (gewinde) és a 40 mm-nél magasabb ültetéshez készült fix magasságú sport futóművekhez vagy ültetőrugókhoz. Bizonyos esetekben a gyári stabilizátorrúd nem alkalmas 40 mm-nél mélyebb ültetésre, és kopogni kezdhet. Ezt a problémát oldja meg a JOM által készített állítható stabilizátorrudak készlete. Kompatibilis a legtöbb márkával!</p>', 'Jom Bochum Seat Ibiza (Typ: 6L), 2002-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-seat-ibiza-typ-6l-2002-tol-allithato-stabilizator-keszlet'),
(1675, '', '<div>\n<p>Egy állítható stabilizátorrúd készletet kínál a V-Maxx gyártó, mely Hollandiában készül. A készlet méretei 15-20cm, 22-27cm és 27-32cm között változnak, cikkszáma pedig SBMO.</p>\n</div>', 'V-Maxx Seat Ibiza (Typ: 6L), 2002-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-seat-ibiza-typ-6l-2002-tol-allithato-stabilizator-keszlet'),
(1676, '', '<p>Egy állítható hosszúságú stabilizátor rúd a Jom Bochum-tól.</p> <p>Hossza 11,5 - 16 cm között változhat.</p> <ul> 	<li>Ez a stabilizátor rúd rövidebb, mint az eredeti gyári verzió, ezért fontos cserélni, ha az állítható futóművet nem a legmagasabb pozícióban használják. Ennek a \"kutyacsontnak\" köszönhetően elkerülhető az összefeszülés, így nem sérül sem az állítható futómű, sem a stabilizátor túlzott feszítése miatt.</li> </ul>  <ul> 	<li>Fontos megjegyezni, hogy ez a termék nem rendelkezik TÜV engedéllyel!</li> </ul> ', 'Jom Bochum Seat Leon (Typ: 1M), 2001-2006-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-seat-leon-typ-1m-2001-2006-ig-allithato-stabilizator-keszlet'),
(1677, '', '<div>\n    <p>Ez a tuning stabilizátor rúd megfelel az alábbi autótípusnak:</p>\n    \n    <ul>\n        <li>Seat Leon (1M) 1.4, 1.6, 1.8, 1.8 T, 1.9 SDI, 1.9 TDI</li>\n        <li>Tipuskód: Leon (1M)</li>\n        <li>Évjárat: 1999.11 - 2005.08</li>\n    </ul>\n    \n    <ul>\n        <li>Elülső stabilizátor átmérője: Ø 25 mm</li>\n        <li>Hátsó stabilizátor átmérője: Ø 25 mm</li>\n        <li>Elülső állíthatóság: nem állítható</li>\n        <li>Hátsó állíthatóság: nem állítható</li>\n        <li>TÜV engedéllyel rendelkezik!</li>\n        <li>Garancia: 12 hónap</li>\n        <li>Gyártva Németországban</li>\n    </ul>\n    \n    <p><strong>Cikkszám: E40-85-005-01-11</strong></p>\n    \n    <p><br />\n    A csomag tartalma: 1 szett, ami magában foglal 2db stabilizátorrudat (1db elülső + 1db hátsó) és a szükséges rögzítőket</p>\n    \n    <p>Fontos: A termék ábrája csak illusztráció! A valós termék formája eltérhet!</p>\n    \n    <p><strong>EIBACH kanyarstabilizátorok: Anti-Roll Kit</strong></p>\n    \n    <p>Az Eibach Anti-Roll-Kit segítségével finomíthatók a gépjármű menettulajdonságai. Ez a kit csökkenti a karosszéria dőlését és a Pro-Kit-tel kombinálva sportosabb vezetési élményt nyújt. Ideális kiegészítő a Pro-Kit-hez. Használható az eredeti lengéscsillapítókkal is, ha a gépjármű alacsonyabbra történő ültetése nem kívánatos.</p>\n    \n    <ul>\n        <li>Karosszéria dőlés csökkentése kanyarodáskor és irányváltáskor</li>\n        <li>Kerekek terhelési különbség csökkentése dinamikus helyzetváltozásoknál</li>\n        <li>Kormányzási stabilitás pozitív befolyásolása</li>\n        <li>DIN ISO/TS 16949 minősítés</li>\n    </ul>\n</div>', 'Eibach Seat Leon (Typ: 1M), 1999.11-2005.08-ig stabilizátor készlet', '', '', '', 'eibach-seat-leon-typ-1m-1999-11-2005-08-ig-stabilizator-keszlet'),
(1678, '', '<strong>Állítható stabilizátorrúd készlet</strong>\\n\\n<p>A JOM Bochum által gyártott <strong>állítható magasságú futóművekhez készült</strong> készlet Németországból származik. A termék különböző méretekben elérhető, mint például 15-20cm, 22-27cm és 27-32cm. A cikkszám: 740412.</p>\\n\\n<p>Ez a készlet kifejezetten ajánlott olyan autótuning projektekhez, ahol <strong>állítható magasságú futóművekre van szükség</strong> vagy amikor az ültetés meghaladja a 40mm-t. Ezen kívül ideális választás <strong>fix magasságú sport futóművekhez</strong> vagy <strong>ültetőrugókhoz</strong>. Előfordulhat, hogy a gyári stabilizátor rúd nem képes megbirkózni a 40mm-t meghaladó ültetéssel, ami kopogáshoz vezethet. Ezt a problémát hivatott megoldani a JOM által gyártott állítható stabilizátorrúd készlet. Emellett kompatibilis számos autómárkával.</p>', 'Jom Bochum Seat Leon (Typ: 1P), 2005-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-seat-leon-typ-1p-2005-tol-allithato-stabilizator-keszlet'),
(1679, '', '<div>\n    Állítható stabilizátorrúd készlet\n    <br>\n    Gyártó: V-Maxx\n    <br>\n    Származási hely: Hollandia\n    <br>\n    Elérhető méretek: 15-20cm, 22-27cm, 27-32cm\n    <br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Seat Leon (Typ: 1P), 2005-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-seat-leon-typ-1p-2005-tol-allithato-stabilizator-keszlet'),
(1680, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\n\n<ul> \n  <li>Gyártó: JOM Bochum</li> \n  <li>Gyártási hely: Németország</li> \n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li> \n  <li>Cikkszám: 740412</li> \n</ul> \n\n<p>Ez a készlet ideális választás <strong>állítható magasságú futóművekhez</strong> (gewinde), valamint 40mm-nél nagyobb ültetéshez <strong>fix magasságú sport futóművekhez</strong> vagy <strong>ültetőrugókhoz</strong>. Előfordulhat, hogy az eredeti gyári stabilizátorrúd nem megfelelő az ilyen mélyebb ültetéshez, és kopogást okoz. Ezt a problémát hivatott megoldani a <strong>JOM állítható stabilizátorrúd készlet</strong>, mely kompatibilis többféle márkával.</p>  \n<p> </p>', 'Jom Bochum  Seat Toledo (Typ: P5), 2004.10-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum--seat-toledo-typ-p5-2004-10-tol-allithato-stabilizator-keszlet'),
(1681, '', '<div>Állítható stabilizátorrúd készlet elérhető</div>\n<div>Gyártó: V-Maxx</div>\n<div>Gyártási hely: Hollandia</div>\n<div>Elérhető méretek: 15-20cm, 22-27cm, 27-32cm</div>\n<div>Cikkszám: SBMO</div>', 'V-Maxx Seat Toledo (Typ: P5), 2004.10-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-seat-toledo-typ-p5-2004-10-tol-allithato-stabilizator-keszlet'),
(1682, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\n\n<ul> \n  <li>Gyártó: JOM Bochum</li> \n  <li>Gyártási hely: Németország</li> \n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li> \n  <li>Cikkszám: 740412</li> \n</ul>  \n\n<p>Az <strong>állítható magasságú futóművekhez szánt</strong> kiegészítő, ideális választás 40 mm-nél magasabb ültetés esetén, valamint <strong>fix magasságú sport futóművekhez és ültetőrugókhoz</strong>. Amennyiben a gyári stabilizátor rúd nem tudja biztosítani a megfelelő stabilitást, különösen mélyebb ültetés esetén, akkor a <strong>JOM által gyártott, állítható stabilizátorrúd készlet</strong> segíthet megelőzni a kopogás jelenségét. Ez a termék kompatibilis a legtöbb autómárkával.</p>  \n\n<p> </p>  ', 'Jom Bochum Skoda Fabia (Typ: 6Y), 1999-2007-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-fabia-typ-6y-1999-2007-ig-allithato-stabilizator-keszlet'),
(1683, '', '<p>Állítható stabilizátorrudak készlete</p>\\n<p>Előállító: V-Maxx</p>\\n<p>Gyártási hely: Hollandia</p>\\n<p>Különböző méretekben elérhető: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Raktári azonosító: SBMO</p>', 'V-Maxx Skoda Fabia (Typ: 6Y), 1999-2007-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-fabia-typ-6y-1999-2007-ig-allithato-stabilizator-keszlet'),
(1684, '', '<p>Egy olyan készlet, amely lehetővé teszi az állítható stabilizátorrudak használatát különböző méretekben. Kiemelkedően ajánlott olyan járművekhez, amelyekhez állítható magasságú futóművek vagy 40 mm-nél magasabb ültetésű sport futóművek vagy ültetőrugók szükségesek. A gyári stabilizátorrúd nem mindig képes kezelni a mélyebb ültetést, ami kopogáshoz vezethet. Ezt a problémát a JOM állítható stabilizátorrúd készlet megoldja. Kompatibilis számos autómárkával.</p>', 'Jom Bochum Skoda Fabia (Typ: 5J), beleértve Kombi, 2007.04-2014-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-fabia-typ-5j-beleertve-kombi-2007-04-2014-ig-allithato-stabilizator-keszlet'),
(1685, '', '<p>Állítható stabilizátorrúd készlet</p>\\n<p>Gyártója a V-Maxx cég, Hollandiában gyártott</p>\\n<p>Kapható méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Cikkszáma: SBMO</p>', 'V-Maxx Skoda Fabia (Typ: 5J), beleértve Kombi, 2007.04-2014-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-fabia-typ-5j-beleertve-kombi-2007-04-2014-ig-allithato-stabilizator-keszlet'),
(1686, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\\n\\n<ul>\\n  <li>Gyártó: JOM Bochum</li>\\n  <li>Származási hely: Németország</li>\\n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li>\\n  <li>Cikkszám: 740412</li>\\n</ul>\\n\\n<p>Az <strong>állítható magasságú futóművekhez</strong> és a 40mm-t meghaladó ültetés esetén alkalmazott <strong>fix magasságú sport futóművekhez</strong> vagy <strong>ültetőrugókhoz</strong> kifejezetten ajánlott a <strong>JOM által gyártott állítható stabilizátorrúd készlet</strong>. Amikor a gyári stabilizátorrúd nem tudja kezelni a 40mm-től mélyebb ültetést, és kopogni kezd, ezt a problémát hivatott megoldani ez a termék. Kompatibilis a legtöbb autómárkával!</p>', 'Jom Bochum Skoda Fabia (Typ: NJ), beleértve Kombi, 2014.08-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-fabia-typ-nj-beleertve-kombi-2014-08-tol-allithato-stabilizator-keszlet'),
(1687, '', '<div>\n    Állítható Stabilizátorrúd Készlet\n    <br>\n    Gyártó: V-Maxx\n    <br>\n    Gyártási hely: Hollandia\n    <br>\n    Méretek: 15-20cm, 22-27cm, 27-32cm\n    <br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Skoda Fabia (Typ: NJ), beleértve Kombi, 2014.08-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-fabia-typ-nj-beleertve-kombi-2014-08-tol-allithato-stabilizator-keszlet'),
(1688, '', '<p>Egy olyan készlet, amely lehetővé teszi az állítható stabilizátorrúd könnyű beszerelését. Készült Németországban a JOM Bochum gyártótól. A készletben található rúd használható állítható magasságú futóművekhez (gewinde) vagy 40mm-nél mélyebb ültetéshez fix magasságú sport futóművekhez vagy ültetőrugókhoz. Egyes esetekben a gyári stabilizátorrúd nem képes megbirkózni a 40mm-nél mélyebb ültetéssel, ami kopogáshoz vezethet. Ez a JOM állítható stabilizátor készlet megoldást nyújt erre a problémára, és kompatibilis a legtöbb márkával.</p>', 'Jom Bochum Skoda Octavia (Typ: 1Z), 2004.06-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-octavia-typ-1z-2004-06-tol-allithato-stabilizator-keszlet'),
(1689, '', '<p>Állítható stabilizátortartó készlet</p>\\n<p>Gyártó: V-Maxx</p>\\n<p>Gyártási hely: Hollandia</p>\\n<p>Elérhető méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Raktári azonosító: SBMO</p>', 'V-Maxx Skoda Octavia (Typ: 1Z), 2004.06-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-octavia-typ-1z-2004-06-tol-allithato-stabilizator-keszlet'),
(1690, '', '<p>Egy olyan termék, amely kifejezetten ajánlott olyan járművek számára, amelyekhez állítható vagy fix magasságú futóművek, valamint ültetőrugók tartoznak. Ha az autó ültetése meghaladja a 40 mm-t, és a gyári stabilizátor rúd nem képes megfelelően működni, akkor érdemes fontolóra venni a JOM által gyártott állítható stabilizátor rúd készletét. A termék kompatibilis a legtöbb autómárkával, és a német JOM Bochum gyártja.</p>', 'Jom Bochum Skoda Octavia (Typ: 5E), beleértve Kombi, 2012.11-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-octavia-typ-5e-beleertve-kombi-2012-11-tol-allithato-stabilizator-keszlet'),
(1691, '', '<p>Állítható stabilizátorrúd szett</p>\\n<p>Gyártó: V-Maxx</p>\\n<p>Eredet: Hollandia</p>\\n<p>Különböző méretekben elérhető: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Cikkszám: SBMO</p>', 'V-Maxx Skoda Octavia (Typ: 5E), beleértve Kombi, 2012.11-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-octavia-typ-5e-beleertve-kombi-2012-11-tol-allithato-stabilizator-keszlet'),
(1692, '', '<strong>Verstelbare stabilisatorstangenset</strong>\n\n<ul>\n  <li>Fabrikant: JOM Bochum</li>\n  <li>Gemaakt in Duitsland</li>\n  <li>Afmetingen: 15-20cm, 22-27cm, 27-32cm</li>\n  <li>Artikelnummer: 740412</li>\n</ul>\n\n<p>Aanbevolen voor voertuigen met <strong>verstelbare ophanging</strong>en (gewinde) of voor voertuigen met een <strong>vaste sportophanging</strong> of <strong>verlagingsveren</strong> van meer dan 40 mm! In sommige gevallen kan de originele stabilisatorstang niet omgaan met een verlaging van meer dan 40 mm en gaat dan ratelen. Dit wordt verholpen door de <strong>JOM verstelbare stabilisatorstangenset</strong>. Compatibel met de meeste automerken!</p>', 'Jom Bochum Skoda Superb (Typ: 3T), 2008-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-superb-typ-3t-2008-tol-allithato-stabilizator-keszlet'),
(1693, '', '<div>\n    Állítható stabilitásjavító rudak szettje\n    <br>\n    Gyártó: V-Maxx\n    <br>\n    Gyártási hely: Hollandia\n    <br>\n    Méretek: 15-20cm, 22-27cm, 27-32cm\n    <br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Skoda Superb (Typ: 3T), 2008-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-superb-typ-3t-2008-tol-allithato-stabilizator-keszlet'),
(1694, '', '<strong>Állítható stabilizátorrúd készlet</strong>\\n\\n<p>Ez a termék a JOM Bochum által készült Németországban. Különféle méretekben kapható: 15-20cm, 22-27cm, 27-32cm. A cikkszám: 740412.</p>\\n\\n<p>Az állítható magasságú futóművekhez és 40mm-t meghaladó ültetés esetén fix magasságú sport futóművekhez vagy ültetőrugókhoz ajánlott. Előfordulhat, hogy a gyári stabilizátor rúd nem bírja el a mélyebb ültetést, és kopogni kezd. Erre a problémára nyújt megoldást a JOM állítható stabilizátor készlet. Kompatibilis számos márka termékeivel.</p>', 'Jom Bochum Skoda Superb (Typ: 3V) Limousine és Kombi, beleértve 4x4, 2015-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-skoda-superb-typ-3v-limousine-es-kombi-beleertve-4x4-2015-tol-allithato-stabilizator-keszlet'),
(1695, '', '<div>\n    Állítható Stabilizátorrúd Készlet\n    <br>\n    Gyártó: V-Maxx\n    <br>\n    Gyártási hely: Hollandia\n    <br>\n    Elérhető méretek: 15-20cm, 22-27cm, 27-32cm\n    <br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Skoda Superb (Typ: 3V) Limousine és Kombi, beleértve 4x4, 2015-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-skoda-superb-typ-3v-limousine-es-kombi-beleertve-4x4-2015-tol-allithato-stabilizator-keszlet'),
(1696, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\n\n<ul>\n  <li>Gyártó: JOM Bochum</li>\n  <li>Gyártási hely: Németország</li>\n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li>\n  <li>Cikkszám: 740412</li>\n</ul>\n\n<p>Az <strong>állítható magasságú futóművekhez</strong> és 40mm feletti ültetéshez ajánlott ez a készlet. Ha a gyári stabilizátorrúd nem felel meg a mélyebb ültetésnek, és kopogni kezd, akkor a <strong>JOM által gyártott változat</strong> segíthet megoldani a problémát. Kompatibilis a legtöbb autómárkával!</p>', 'Jom Bochum Volkswagen Eos, 2006.05-2014-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-eos-2006-05-2014-ig-allithato-stabilizator-keszlet'),
(1697, '', '<div>\n    Állítható stabilizátorrúd készlet\n    <br>\n    Gyártó: V-Maxx\n    <br>\n    Származási hely: Hollandia\n    <br>\n    Méretek: 15-20cm, 22-27cm, 27-32cm\n    <br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Volkswagen Eos, 2006.05-2014-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-eos-2006-05-2014-ig-allithato-stabilizator-keszlet'),
(1698, '', '<strong>Univerzális állítható stabilizátor rúd</strong></p>  <p>A hossza 11,5 - 16 cm között változhat.</p>  <ul> 	<li>Ez a stabilizátor rúd rövidebb, mint a gyári verzió, így ajánlott cserélni, ha az állítható futóművet nem a legmagasabb pozícióban használják. Ez a módosítás segít elkerülni a túlzott feszülést, ami károsíthatja az alkatrészeket.</li> </ul>  <ul> 	<li>Fontos megjegyezni, hogy ez a termék nem rendelkezik TÜV engedéllyel!</li> </ul>', 'Jom Bochum Volkswagen Golf 4, 1997-2003-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-golf-4-1997-2003-ig-allithato-stabilizator-keszlet'),
(1699, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\\n\\n<ul>\\n  <li>Manufaktúra: JOM Bochum</li>\\n  <li>Gyártás helye: Németország</li>\\n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li>\\n  <li>Cikkszám: 740412</li>\\n</ul>\\n\\n<p>Ez a készlet ideális választás állítható magasságú futóművekhez (gewinde) és fix magasságú sport futóművekhez vagy ültetőrugókhoz, különösen 40mm-t meghaladó ültetés esetén. Amikor a gyári stabilizátor rúd nem képes megbirkózni a mélyebb ültetéssel, és kopogni kezd, a JOM állítható stabilizátor készlet segít ezen a problémán. Kompatibilis számos autómárkával!</p>', 'Jom Bochum Volkswagen Golf 5, 2003-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-golf-5-2003-tol-allithato-stabilizator-keszlet'),
(1700, '', '<p>Készlet állítható stabilizátorrudakhoz</p>\\n<p>A gyártója a V-Maxx cég</p>\\n<p>Eredet: Hollandia</p>\\n<p>Kapható méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Cikkszám: SBMO</p>', 'V-Maxx Volkswagen Golf 5, 2003-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-golf-5-2003-tol-allithato-stabilizator-keszlet'),
(1701, '', '<p>Egy olyan termék, amely segít kiküszöbölni a gyári stabilizátor rúd által okozott problémákat, amikor 40mm-t meghaladó mélységben ültetjük az autót. A JOM Bochum által gyártott állítható stabilizátor rúd készlet Made in Germany-ben. Különösen ajánlott olyan állítható magasságú futóművekhez (gewinde), valamint fix magasságú sport futóművekhez vagy ültetőrugókhoz, amelyeknél 40mm-t meghaladó ültetés szükséges. A készlet méretei: 15-20cm, 22-27cm, 27-32cm. Cikkszám: 740412. Kompatibilis a legtöbb autómárkával.</p>', 'Jom Bochum Volkswagen Golf 6, 2008.09-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-golf-6-2008-09-tol-allithato-stabilizator-keszlet'),
(1702, '', '<p>Állítható stabilizátorrúd készlet</p>\\n<p>A gyártója a V-Maxx cég, mely Hollandiában található.</p>\\n<p>Az egyes méretváltozatok tartománya: 15-20cm, 22-27cm, 27-32cm.</p>\\n<p>A cikkszáma ennek a terméknek: SBMO</p>', 'V-Maxx Volkswagen Golf 6, 2008.09-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-golf-6-2008-09-tol-allithato-stabilizator-keszlet'),
(1703, '', '<p>Egy olyan termék, amely segít a gépjármű stabilitásának biztosításában, különösen ajánlott olyan autókhoz, amelyeknél állítható magasságú futóművet alkalmaznak, vagy 40mm-nél mélyebb ültetés esetén fix magasságú sport futóművekhez vagy ültetőrugókhoz. Bizonyos esetekben a gyári stabilizátor rúd nem képes kezelni a nagyobb ültetést, és kopogni kezdhet. Erre a problémára nyújt megoldást a JOM által gyártott állítható stabilizátor rúd készlet. A termék kompatibilis a legtöbb autómárkával, és a méretek 15-20cm, 22-27cm, valamint 27-32cm között változnak.</p>', 'Jom Bochum Volkswagen Golf 7, 2013.05-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-golf-7-2013-05-tol-allithato-stabilizator-keszlet'),
(1704, '', '<div>\n<p>Egy állítható stabilizátorrúd készletet mutatunk be, melyet a V-Maxx gyárt Hollandiában. A készlet méretei: 15-20cm, 22-27cm, 27-32cm. A termék cikkszáma: SBMO.</p>\n</div>', 'V-Maxx  Volkswagen Golf 7, 2013.05-től, állítható stabilizátor készlet', '', '', '', 'v-maxx--volkswagen-golf-7-2013-05-tol-allithato-stabilizator-keszlet'),
(1705, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\n\n<ul>\n  <li>Gyártó: JOM Bochum</li>\n  <li>Származási hely: Németország</li>\n  <li>Méretek: 15-20cm, 22-27cm, 27-32cm</li>\n  <li>Cikkszám: 740412</li>\n</ul>\n\n<p>Az <strong>állítható magasságú futóművekhez</strong> és a 40mm-t meghaladó ültetésű <strong>fix magasságú sport futóművekhez</strong> vagy <strong>ültetőrugókhoz</strong> különösen ajánlott ez a termék. Előfordulhat, hogy a gyári stabilizátorrúd nem bírja el a 40mm-től mélyebb ültetést, és kopogás jelentkezhet. Ezt a problémát hivatott megoldani a <strong>JOM állítható stabilizátorrúd készlet</strong>, mely kompatibilis a legtöbb márkával.</p>', 'Jom Bochum Volkswagen Jetta MK5, 2005.08-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-jetta-mk5-2005-08-tol-allithato-stabilizator-keszlet'),
(1706, '', '<p>Egyedi hosszúságú stabilizátorrúd szett</p>\\n<p>Gyártó: V-Maxx</p>\\n<p>Gyártási hely: Hollandia</p>\\n<p>Különböző méretekben elérhető: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Rendelési azonosító: SBMO</p>', 'V-Maxx Volkswagen Jetta MK5, 2005.08-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-jetta-mk5-2005-08-tol-allithato-stabilizator-keszlet'),
(1707, '', '<p>Egy olyan termék, amely lehetővé teszi az autó állítható stabilizátorrudának beállítását. Ideális választás állítható magasságú futóművekhez és 40mm-nél magasabb ültetésekhez. A JOM Bochum által gyártott készlet Made in Germany-ben készül és többféle méretben elérhető: 15-20cm, 22-27cm, 27-32cm. A cikkszám: 740412. Ha a gyári stabilizátor rúd nem bírja el a mélyebb ültetést, és kopogni kezd, akkor a JOM állítható stabilizátor készlet segíthet ezen a problémán, mivel kompatibilis a legtöbb márkával.</p>', 'Jom Bochum Volkswagen Passat 3C, 2005-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-passat-3c-2005-tol-allithato-stabilizator-keszlet'),
(1708, '', '<p>Állítható stabilizátorrúd készlet elérhető</p>\\n<p>V-Maxx gyártó által létrehozva</p>\\n<p>Gyártási hely: Hollandia</p>\\n<pElérhető méretek: 15-20cm, 22-27cm, 27-32cm</p>\\n<p>Cikkszám: SBMO</p>', 'V-Maxx Volkswagen Passat 3C, 2005-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-passat-3c-2005-tol-allithato-stabilizator-keszlet');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1709, '', '<p>Egy olyan termék, amelynek segítségével könnyedén szabályozhatod az autód futóművének magasságát. Kifejezetten ajánlott olyan autókhoz, amelyeknél az eredeti stabilizátor rúd nem képes elviselni a nagyobb ültetést. Ezzel a <strong>JOM állítható stabilizátor készlet</strong>tel könnyedén kiküszöbölheted ezt a problémát, így a legtöbb autómárkával kompatibilis. A készlet tartalmazza a következő méretű rúdakat: 15-20cm, 22-27cm, 27-32cm. Ideális választás <strong>állítható magasságú futóművekhez (gewinde)</strong>, valamint 40mm-t meghaladó ültetés esetén <strong>fix magasságú sport futóművekhez</strong> vagy <strong>ültetőrugókhoz</strong>.</p>', 'Jom Bochum Volkswagen Passat CC, 2008.06-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-passat-cc-2008-06-tol-allithato-stabilizator-keszlet'),
(1710, '', '<p>Egyedi állítható stabilizátorrudak kaphatók a V-Maxx gyártótól, melyek Hollandiában készülnek. A stabilizátorrudak különböző méretekben elérhetők: 15-20cm, 22-27cm és 27-32cm. A termék cikkszáma: SBMO.</p>', 'V-Maxx Volkswagen Passat CC, 2008.06-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-passat-cc-2008-06-tol-allithato-stabilizator-keszlet'),
(1711, '', '<p>Egy olyan termék, amely kifejezetten ajánlott az állítható magasságú futóművekhez és a 40mm-t meghaladó ültetéshez. A gyártója a JOM Bochum, Made in Germany. Különféle méretekben elérhető: 15-20cm, 22-27cm, 27-32cm. A cikkszáma: 740412. A JOM állítható stabilizátor készlet segít megelőzni a gyári stabilizátor rúd kopását és kompatibilis számos autómárkával.</p>', 'Jom Bochum Volkswagen Polo 6R, 2009.06-tól, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-polo-6r-2009-06-tol-allithato-stabilizator-keszlet'),
(1712, '', '<div>\n    Állítható stabilizátorrúd készlet\n    <br>\n    Gyártó: V-Maxx\n    <br>\n    Made in Hollandia\n    <br>\n    Méretek: 15-20cm, 22-27cm, 27-32cm\n    <br>\n    Cikkszám: SBMO\n</div>', 'V-Maxx Volkswagen Polo 6R, 2009.06-tól, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-polo-6r-2009-06-tol-allithato-stabilizator-keszlet'),
(1713, '', '<p>Egy olyan készlet, amely lehetővé teszi az állítható stabilizátorrúd beépítését különböző méretekben. Kifejezetten ajánlott olyan állítható magasságú futóművekhez (gewinde), valamint 40mm-nél magasabb ültetéssel rendelkező fix magasságú sport futóművekhez vagy ültetőrugókhoz. A gyári stabilizátor rúd nem mindig képes megbirkózni a mélyebb ültetéssel, és kopogni kezdhet. Ennek a problémának a megoldására szolgál a JOM állítható stabilizátor készlet, mely kompatibilis számos márkával.</p>', 'Jom Bochum Volkswagen Polo 9N, 2001.11-2009.05-ig, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-polo-9n-2001-11-2009-05-ig-allithato-stabilizator-keszlet'),
(1714, '', '<div>Állítható stabilitásjavító rudak készlete</div>\n<div>Gyártó: V-Maxx</div>\n<div>Székhely: Hollandia</div>\n<div>Elérhető méretek: 15-20cm, 22-27cm, 27-32cm</div>\n<div>Cikkszám: SBMO</div>', 'V-Maxx Volkswagen Polo 9N, 2001.11-2009.05-ig, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-polo-9n-2001-11-2009-05-ig-allithato-stabilizator-keszlet'),
(1715, '', '<strong>Állítható Stabilizátorrúd Készlet</strong>\n\n<ul> \n  <li>Manufacturer: JOM Bochum</li> \n  <li>Gyártva Németországban</li> \n  <li>Dimensions: 15-20cm, 22-27cm, 27-32cm</li> \n  <li>Article number: 740412</li> \n</ul>  \n\n<p>Az <strong>állítható magasságú futóművekhez</strong> és a 40mm-t meghaladó ültetéshez kifejezetten ajánlott a <strong>fix magasságú sport futóművekhez</strong> vagy <strong>ültetőrugókhoz</strong>! Előfordulhat, hogy a gyári stabilizátorrúd nem bírja el a 40mm-től mélyebb ültetést, és kopogni kezd. Ezt a problémát hivatott megoldani a <strong>JOM állítható stabilizátorrúd készlet</strong>, mely kompatibilis számos márkával!</p>  \n\n<p> </p>  ', 'Jom Bochum Volkswagen Scirocco MK3, 2008.05-től, állítható stabilizátor készlet', '', '', '', 'jom-bochum-volkswagen-scirocco-mk3-2008-05-tol-allithato-stabilizator-keszlet'),
(1716, '', '<p>Állítható stabilizátorrudak összeállítása</p>\\n<p>A gyártó cég székhelye Hollandiában található</p>', 'V-Maxx Volkswagen Scirocco MK3, 2008.05-től, állítható stabilizátor készlet', '', '', '', 'v-maxx-volkswagen-scirocco-mk3-2008-05-tol-allithato-stabilizator-keszlet'),
