(2446, '', 'Suzuki futófényes tükör index párban sötétített<br />\nA legújabb fejlesztések egyike az úgynevezett dinamikus fényű index, aminek lényege hogy a led izzók fénye végig fut a lámpatestben, nem egy ütemben villannak fel, mint egy hagyományos lámpa esetében<br />\n<br />\nA gyári halogén tükör indexekkel megegyező futófényes irányjelzők már eléhetőek nálunk!<br />\n<br />\nA búra és a foglalat típus is teljes mértékben megegyezik a gyári indexekkel, így egyszerűen kicserélhető pár perc alatt, nem szükséges hozzá semmilyen átalakítás<br />\n<br />\nA fényerőssége 140lumen így jóval erősebb mint a sima gyári irányjelzők. SMD2835 típusú ledek találhatóak benne, ami garantálja a hosszú élettartamot és az egységes fényt.<br />\n<br />\nE jeles,CE szabványos termék<br />\n<br />\nOEM szám：603658232542<br />\nKompatibilis Suzuki modellek:<br />\nSuzuki Swift 2012-től', 'Suzuki futófényes tükör index párban sötétített', '', '', '', 'suzuki-futofenyes-tukor-index-parban-sotetitett'),
(2447, '', 'Volkswagen futófényes tükör index párban sötétített<br />\nA legújabb fejlesztések egyike az úgynevezett dinamikus fényű index, aminek lényege hogy a led izzók fénye végig fut a lámpatestben, nem egy ütemben villannak fel, mint egy hagyományos lámpa esetében<br />\n<br />\nA gyári halogén tükör indexekkel megegyező futófényes irányjelzők már eléhetőek nálunk!<br />\n<br />\nA búra és a foglalat típus is teljes mértékben megegyezik a gyári indexekkel, így egyszerűen kicserélhető pár perc alatt, nem szükséges hozzá semmilyen átalakítás<br />\n<br />\nA fényerőssége 140lumen így jóval erősebb mint a sima gyári irányjelzők. SMD2835 típusú ledek találhatóak benne, ami garantálja a hosszú élettartamot és az egységes fényt.<br />\n<br />\nE jeles,CE szabványos termék<br />\nKompatibilis Volkswagen modellek:<br />\n<br />\n Volkswagen Golf 5 5 2003-2008<br />\nVolkswagen Golf 5 Variant 2007-2008<br />\nVolkswagen GTI 5 2004-2008<br />\nVolkswagen EOS 2006-2008<br />\nVolkswagen Golf 5 / 6 Plus 2005-2013<br />\nVolkswagen Jetta 5 2006-2011<br />\nVolkswagen Passat B5.5  3BG 2001-2005<br />\nVolkswagen Passat B6 3C 2005-2010 Prefacelift R36 (CC-kkel nem)<br />\nVolkswagen Sharan 2003-2010<br />\n<br />\n<br />\n', 'Volkswagen futófényes tükör index párban sötétített', '', '', '', 'volkswagen-futofenyes-tukor-index-parban-sotetitett'),
