(2450, '', 'BMW futófényes tükör index párban sötétítettA legújabb fejlesztések egyike az úgynevezett dinamikus fényű index, aminek lényege hogy a led izzók fénye végig fut a lámpatestben, nem egy ütemben villannak fel, mint egy hagyományos lámpa esetébenA gyári halogén tükör indexekkel megegyező futófényes irányjelzők már eléhetőek nálunk!A búra és a foglalat típus is teljes mértékben megegyezik a gyári indexekkel, így egyszerűen kicserélhető pár perc alatt, nem szükséges hozzá semmilyen átalakításA fényerőssége 140lumen így jóval erősebb mint a sima gyári irányjelzők. SMD2835 típusú ledek találhatóak benne, ami garantálja a hosszú élettartamot és az egységes fényt.E jeles,CE szabványos termékKompatibilis BMW modellekBMW X3 F25 2012~<br />\nBMW X4 F26 2015~<br />\nBMW X5 F15 2015~<br />\nBMW X6 F16 2016', 'BMW futófényes tükör index párban sötétített', '', '', '', 'bmw-futofenyes-tukor-index-parban-sotetitett-1'),
(2451, '', 'Ablaktörlő lapát javító<br />\nA jó minőségű ablaktörlő lapátok több ezer forintba is kerülhetnek, de sajnos egy idő után még ezek is elkopnak és csíkosan kezdik el törölni a szélvédőt<br />\n<br />\nA gumi anyagában van még tartalék, hiszen csak milimétereket kopik el az éle. Ezzel a kis javító eszközzel még két alkalommal lehet kiélezni a lapátot<br />\n<br />\nAz eszköz nagyon egyszerű.. Az élezőbe egy megszabott úton fut végig az ablaktörlő lapát, egy penge pedig pontosan egy méretre visszavágja a lapát élét<br />\n<br />\n&amp;nbsp;', 'Ablaktörlő lapát javító', '', '', '', 'ablaktorlo-lapat-javito'),
(2452, '', 'Mikroszálas törlőkendő A mikroszálas törlőkendők manapság igen elterjedtek, mivel anyaguknak köszönhetően sokkal könnyebb és környezetbarátabb módon lehet velük tisztítaniA mikroszálak lényege, hogy rengeteg kis mikroszkópikus hurok alkotja az egészet, melyek elektrosztatikus szálakként működnek, így mindenféle vegyszer nélkül akár sima vizzel is lelehet szedni a makacs zsírfoltokat illetve portA lényeg leegyszerüsítve, hogy nem ideoda tolod a port és a zsírt a kocsin hanem magába szívja őket a sima rongyokkal ellentétbenMérete: 25x25cm<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										25x25cm méretű<br />\n<br />\n<br />\n										belső és külső tisztításra is<br />\n<br />\n<br />\n		Mire lehet használni a mikroszálas törölközőt?A webshop profilja lévén elsősorban autótakarításhoz ajánlom,de ezen felül tökéletes megoldás otthoni tisztításra is és kényes felületek mint pl laptop TV mobilok portalanítására is', 'Mikroszálas törlőkendő 1db', '', '', '', 'mikroszalas-torlokendo-1db'),
(2453, '', 'Mikroszálas törölköző 60*90cm<br />\nA mikroszálas törölköző a leghatékonyabb és a legnagyobb festék szárító törülköző a Royaltuning kínálatában. Kétségtelen, hogy egy óriás a gépkocsi szárító törölközők kategóriájában 600 gramm/ négyzetméter.<br />\n<br />\nA rendkívül nagy nedvszívó képességet a legmagasabb kivitelezéssel ötvözték, kiváló minőségű terméket biztosítva, amely jól működik mind amatőr, és professzionális használat során is.<br />\n<br />\nA nagyméretű mikroszálas törölköző puha és tartós mikroszálas anyagból készül, speciálisan kialakított szálak szövésével a &amp;#34;Double loop&amp;#34; technológiában. Nagyon könnyen és nagyon hatékonyan gyűjti össze a felesleges vizet a festék felületéről, csíkok nélkül.<br />\n<br />\nEz lehetővé teszi az egész autó gyors szárítását anélkül, hogy a törülközőt &amp;#34;meg kellene csavarni&amp;#34;. A nagy grammtömeg nagyszerű kényelmet nyújt a munkának, és csökkenti a festék karcolásának kockázatát.<br />\n<br />\nHasználható a festék felületének szárítására és gyors részletező anyagok felvitelére.<br />\n<br />\nKöteleznie kell egy érintés nélküli autómosón, ahol gyorsan meg kell szárítania a karosszériát, mielőtt a vízkő nyomai megjelennek.<br />\n<br />\nLeírás:<br />\n<br />\n 	szín: szürke / kék<br />\n 	méret: 60x90cm<br />\n 	súly: 600 gsm<br />\n 	összetétele: 80% poliészter, 20% poliamid<br />\n<br />\n<br />\n 	Könnyen használható!<br />\n 	60x90cm méretű<br />\n 	Tökéletes tisztítás<br />\n<br />\nMire lehet használni a mikroszálas törölközőt?<br />\nAz autómosást követően a mikroszálas törölközővel kíméletesen le lehet szárítani az autót.<br />\n<br />\nNem marad sehol vízfolt az autón, és a fényezést sem karcolja össze.<br />\n<br />\nNagy méretének köszönhetően gyorsan le lehet vele törölni a teljes autót<br />\nHogyan kell használni a mikrozálas törölközőt?<br />\n<br />\n<br />\n 	Alaposan mosd le az autót<br />\n 	Terítsd rá a vizes felületekre a mikroszálas törölközőt<br />\n 	A két sarkánál fogva húzd végig a karosszérián a törölközőt<br />\n 	Többször megismételhető a folyamat<br />\n', 'Mikroszálas törölköző 60*90cm', '', '', '', 'mikroszalas-torolkozo-60*90cm'),
(2454, '', 'Ledes nappali menetfény szett index és üdvözlőfény funkcióvalDRL ledes nappali menetfény szett, hideg fehér fénnyel és bekapcsoláskor üdvözlő fénnyel, illetve narancssárga index funkcióval rendelkezik.Az index funkció a mai autókhoz hasonlóan futófénnyel világit, ez a képek közt illusztrálva van.Az üdvözlőfény bekapcsoláskor végig fut a led teljes hosszán majd szakaszokban világítva áll be a menetfény.A ledcsík könnyen felszerelhető, alakítható öntapadós hátlappal van ellátva és teljesen vízálló szilikonbukolatba van építveAz index funkció müködéséért felelős vezérlő egység már bele van építve  Amikor indexel, akkor nem világít fehéren, ezt automatikusan váltja.Amennyiben automatikus ki/be kapcsolással szeretné használni, akkor érdemes menetfény vezérlő elektronikával bekötni.Mérete: 15cm hosszú, és 2cm széles..Menetfény adatai:Rendszer: 12V <br />\nFogyasztás: 20 Watt<br />\nFényerő: 1300 LumenE jellel nem rendelkezikA termékről bemutató videó is megtekinthető Youtube csatornánkon!Üdvözlőfény és futófényes irányjelzőAz üdvözlőfény bekapcsoláskor végig fut a led teljes hosszán majd szakaszokban világítva áll be a menetfény.Az irányjelző futófénnyel világít.<br />\n<br />\n		Hideg fehér menetfény és sárga irányjelzőA menetfény hideg fehér fénnyel világít, az irányjelző pedig borostyánsárga fénnyel.<br />\n<br />\n		Könnyedén felszerelhető minden autóraA ledcsík könnyen felszerelhető, alakítható öntapadós hátlappal van ellátva és teljesen vízálló burkolatba van építve.Mérete: 15cm hosszú, és 2cm széles..<br />\n', 'Ledes nappali menetfény szett index és üdvözlőfény funkcióval 2db', '', '', '', 'ledes-nappali-menetfeny-szett-index-es-udvozlofeny-funkcioval-2db');
