(2456, '', 'Feszültségmérő jelző funkciókkalSzéles körben használható autókhoz, motorkerékpárokhoz, munkagépekhez  és tesztelő állomásokhoz.Bekapcsoláskor a feszültségmérő kijelzője fényjátékkal kapcsol be.Kék leddel világít a kijelző. Tökéletesen látni rajta a kijelzett értéket, de nem világít túl erősen, így éjszaka sem zavaró.A normál mérési tartománya 8V-16V között van. Ha 11,5 V alatti vagy 19,8 V feletti a feszültség akkor riasztás történik. A voltmérő száma folyamatosan villog. Az &amp;#34;LLL&amp;#34; jelzést jeleníti meg, ha a feszültség alacsonyabb, mint a mérési tartomány &amp;#34;HHH&amp;#34; jelenik meg, ha a feszültség magasabb, mint a mérési tartományRendkívül vékony, és kompakt kialakítású. 5,7x2,9cmVízálló, porálló, ütésálló mivel elsősorban motorokhoz és egyéb járművekhez lett kialakítva.<br />\n<br />\n<br />\n										Könnyen beszerelhető!<br />\n<br />\n<br />\n										Kompakt kialakítású<br />\n<br />\n<br />\n										Jelző funkciókkal<br />\n<br />\n<br />\n		 visszajelzést kaphatsz a töltésről, akku állapotról!A feszültségmérővel folyamatosan nyomon követheted, hogy a megfelelő tartományban mozog-e a töltés.Az eszköz 8-16V között mér, ha ezen a skálán kívül esik a mérés akkor jelzi az eszköz.Alacsonyabb állapotbál LLL felirat villog, magasabbnál pedig HHH. <br />\n<br />\n		Minden 12V rendszerhez használható!A feszültségmérő minden 12V rendszerhez használható.Víz, por és ütésálló így autón és motoron kívül akár quadhoz, hajóhoz és munkaégéphez is használható.<br />\n', 'Feszültségmérő jelző funkciókkal', '', '', '', 'feszultsegmero-jelzo-funkciokkal'),
(2457, '', 'Esővédő visszapillantó tükörre 2dbA visszapillantó tükör burkolatára lehet felragasztani ezeket a védőket, és így meggátolja, hogy az eső a tükörre essen.A tükrön megmaradt esőcseppek rontják a látási viszonyokat, nehezebb sávot váltani és parkolni is.A kialakított kétoldalú ragasztóval egyszerűen fel lehet tenni a tükör burkolatára a védőt.Az anyaga ABS műanyag, a tükör formájára lehet hajlítani.Mintás felületre nem lehet felragasztani, az ilyen kivitelű tükrökre nem ragad fel!Lásson tisztán esőben is!A tükör burkolatára felhelyezve megvédi a tükröt az esőtől. Így mindig tisztán láthatja a tükörben az utat.Kényelmesen és biztonságosan lehet sávot váltani vagy parkolni!<br />\n<br />\n		A legtöbb tükörre felrakható!Az anyaga ABS műanyagEllenáll az UV sugárzásnak és a környezeti hatásoknak. Rugalmas az anyaga, így szépen fel lehet tenni szinte minden tükörre.Mintás felületre nem lehet felragasztani, az ilyen kivitelű tükrökre nem ragad fel!<br />\n<br />\n<br />\n		A  felszerelése nagyon egyszerű! <br />\n<br />\n<br />\n										A tükör burkolatát zsírtalanítani kell<br />\n<br />\n<br />\n										Az esővédőn található ragasztócsíkról le kell húzni a védőfóliát<br />\n<br />\n<br />\n										A ragasztócsíknál fogva fel kell ragasztani a tükörburkolatra<br />\n<br />\n', 'Esővédő visszapillantó tükörre 2db', '', '', '', 'esovedo-visszapillanto-tukorre-2db'),
(2458, '', 'Fólia telepítő készlet<br />\nAutó fóliák és matricák telepítésére kialakított készlet. Minden olyan eszközt tartalmaz amivel kényelmesen és szakszerűen lehet dolgozni.<br />\n<br />\nA készlet tartalmaz a fólia vágásához szükséges precíziós vágókéseket. A pengék vékonyak és nagyon élesek így szépen lehet velük levágni a fóliákat, nem akad meg az erősebb anyagokban sem. Ezzel elkerülhető, hogy sorjás vagy ferde legyen a vágás széle.<br />\n<br />\nA simítólapokkal biztonságosan végig lehet simítani a fóliát, hogy mindenhol megfelelő tapadás alakuljon ki. Az élei polárbetéttel vannak ellátva így nem karcolja meg a fólia vagy matrica felületét.<br />\n<br />\nA biztonsági vágókés a hosszabb fólia darabok levágásához szükséges. A rejtett horog alakú pengének köszönhetően pontos lesz a vágáskép, és nem karcolja meg a vágás alatti felületet.<br />\n<br />\nA készlet tartalma:<br />\n<br />\n 	műanyag burkolatú biztonsági fóliavágó<br />\n 	fóliavágó kés + 10 db tartalék penge<br />\n 	preciziós vágótoll igazításhoz + 5db tartalék penge<br />\n 	applikációs lapát polárbetéttel (100x70 mm)<br />\n 	2 db simító lapát szövet betéttel (100x45 mm)<br />\n<br />\n<br />\n<br />\nPrecíziós vágókésekkel:<br />\n<br />\nA készlet tartalmaz a fólia vágásához szükséges precíziós vágókéseket. A pengék vékonyak és nagyon élesek így szépen lehet velük levágni a fóliákat, nem akad meg az erősebb anyagokban sem. Ezzel elkerülhető, hogy sorjás vagy ferde legyen a vágás széle.<br />\n<br />\n<br />\n<br />\nSimítólapokkal:<br />\n<br />\nA simítólapokkal biztonságosan végig lehet simítani a fóliát, hogy mindenhol megfelelő tapadás alakuljon ki. Az élei polárbetéttel vannak ellátva így nem karcolja meg a fólia vagy matrica felületét.<br />\n<br />\n', 'Fólia telepítő készlet', '', '', '', 'folia-telepito-keszlet'),
(2459, '', 'Kiegészítő visszapillantó tükör 2db<br />\nA gyári visszapillantó tükrök nem mindig elegendőek a biztonságos sávváltáshoz illetve parkoláshoz.<br />\nA holttérben akár egy autó is &amp;#34;elbújhat&amp;#34; vagy parkolás esetén egy nagyobb padka akár oszlop is komoly kárt tud tenni az autóban.<br />\n<br />\nMiért ne kerülné el ezeket a gondokat és könnyítené meg a mindennapjait.<br />\n<br />\nA kiegészítő tükrök könnyen felszerelhetőek, és semmilyen átalakítást nem igényelnek.<br />\n<br />\nA tükrök a felhelyezés után is mozgatható, így a megfelelő pozícióba lehet állítani.<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\nPillanatok alatt felhelyezhető, átalakítás nélkül!<br />\nA tükörlapra egyszerűen fel kell ragasztani a kiegészítő tükör talpát, majd erre jön maga a kiegészítő tükör.<br />\n<br />\nA tükör mozgatható,beállítható a felragasztás után. A talp fix, de a tükör rajta mozgatható.<br />\n<br />\n<br />\nNagyobb látószög, biztonságos autózás!<br />\nA kiegészítő tükör felhelyezése után nagyobb látószöge lesz a tükörnek, így szinte nincs holttér.<br />\n<br />\nA sávváltáskor jobban észrevehető a mellettünk lévő holttérben lévő autó vagy motor.<br />\n<br />\nA parkoláskor is kényelmet nyújt a tükör nagyobb látótere. Az autó széleit sokkal jobban látni, illetve könnyebben észrevehetőek az alacsony oszlopok, padkák ami a sima tükörben nem lenne benne.<br />\n<br />\n<br />\n<br />\n', 'Kiegészítő visszapillantó tükör 2db', '', '', '', 'kiegeszito-visszapillanto-tukor-2db'),
(2461, '', 'Bőr tisztító  kefe<br />\nA bőr tisztító kefe az egyik leghatékonyabb és legegyszerűbb eszköz a bőrkárpitok tisztítására. Ez az eszköz különösen hasznos, ha a bőrkárpitot már egy ideje nem tisztítottuk meg, vagy ha a bőrön keményebb szennyeződések ragadtak meg.<br />\n<br />\nA bőr tisztító kefe kialakítása kifejezetten a bőrkárpitok és szövet kárpitok finom felületének tisztítására lett tervezve. A kefe finom sörtéivel nem okoz kárt a bőr felületén, mégis hatékonyan eltávolítja a koszt és a foltokat.<br />\n<br />\nA bőr tisztító kefe használata rendkívül egyszerű. A kefét illetve a tisztítandó felületet is fújja be a megefelelő szerrel, és finoman, de határozottan körkörös mozdulatokkal tisztítsa meg a felületet. A kefe finom sörtéi hatékonyan eltávolítják a koszt, anélkül, hogy megrongálnák a bőrt.<br />\n<br />\nA bőr tisztító kefe nagyon praktikus, hiszen kis méretű és könnyen tárolható. Az eszközt könnyen magával lehet vinni, így a koszos foltok bármikor eltávolíthatóak, még akkor is, ha éppen utazás közben koszolódik be a kárpit.<br />\n<br />\nA kefe sörtéi puha, környezetbarát anyagból készültek, ami kíméli a bőrt és a környezetet. A kefe markolata fa, a sörtéi természetes szizálkenderből vannak , így tartós és hosszú élettartamú.<br />\n<br />\nA kefe nem csak autó kárpitokhoz használható, természetesen bármilyen bőr vagy szövet kárpit tisztítására alkalmas. Kanapék, kabátok, táskák tisztításához is kiváló választás.<br />\n<br />\nTökéletesen tisztít, elérve a bőr minden részét és mélyedését. Nem károsítja a bőrfelületet és nem hagy csíkokat. Tökéletesen illeni fog a kezedbe.<br />\n<br />\nA royaltuning.hu oldalon az autóápolási eszközök mellett természetesen a hozzájuk való autóápolási szereket is megtalálod! A bőr tisztitó kefékhez többféle bőr tisztító és ápoló spray közül válogathatsz.<br />\n<br />\n 	Könnyen használható!<br />\n 	Sűrű, puha sörtékkel<br />\n 	Tökéletesen megtisztítja a bőrkárpitok felületét<br />\n<br />\nMire lehet használni a bőr kárpit tisztító kefét?<br />\nAz autóban megtalálható bőrkárpitokat, műszerfalat kormányt és egyéb kiegészítőket lehet megfelelően letisztítani.<br />\n<br />\nA kefe puha sörtéi kíméletesen oldják fel a letapadt koszt, és nem sértik fel a bőr felületét. A megfelelő bőrtisztító és ápoló szereket szépen egyenletesen fel lehet hordani a tisztítandó felületre.<br />\nHogyan kell használni a bőr tisztító kefét?<br />\n<br />\n<br />\n 	A tisztító szert a bőr felületre kell permetezni, illetve a kefe sörtéire<br />\n 	Körkörös finom mozdulatokkal dolgozzuk el a tisztító szert<br />\n 	Pár perc után letörölthető a tisztítószer és a feloldott szennyeződések<br />\n 	Többször megismételhető a folyamat<br />\n', 'Bőr tisztító kefe', '', '', '', 'bor-tisztito-kefe'),
(2462, '', 'Kerék tisztító kefeA felnik mellett a gumikat sem szabad elhanyagolni. Fontos a megfelelő és alapos tisztításuk, mivel ez is hozzájárul az autó megjelenéséhez és a gumik élettartama is növelhető.A gumik oldalfalán lévő feliratok és minták miatt gyakran nehéz a szennyeződéseket leszedni, ezért érdemes mosáskor a gumikat átmosni egy ilyen kefével. A puha, de hatékony sörtéi segítenek eltávolítani a koszt, a port, és egyéb szennyeződéseket, amelyek az autó kerekein felhalmozódtak.A kefe sörtéi nem okoznak karcolásokat a felni felületén sem!Kényelmes műanyag nyelének és a sűrű sörtés fejének köszönhetően élvezet vele az autó tisztítása.Az autó kerék tisztító kefe könnyű, praktikus és kényelmes használatot biztosít. Az eszköz kialakítása kifejezetten járművek gumijainak a tisztítására lett tervezve, így nagyon könnyű vele dolgozni. A kefe könnyen kezelhető, és könnyen hozzáférhet a nehezen elérhető helyekhez is.Az autó kerék tisztító kefe nyele törésálló ABS műanyagból készült, így intenzív használat mellett is tartós marad.Használat után könnyedén elmosható, teljesen kitisztítható a kefe.A royaltuning.hu oldalon az autóápolási eszközök mellett természetesen a hozzájuk való autóápolási szereket is megtalálod! A kerék tisztitó kefékhez többféle gumi és felni ápoló spray közül válogathatsz.<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Sűrű, puha sörtékkel<br />\n<br />\n<br />\n										Tökéletesen megtisztítja a teljes kereket<br />\n<br />\n<br />\n		Mire lehet használni a kerék tisztító kefét?Az autó kerék tisztító kefe könnyű, praktikus és kényelmes használatot biztosít. Az eszköz kialakítása kifejezetten járművek gumijainak a tisztítására lett tervezve, így nagyon könnyű vele dolgozni. A kefe könnyen kezelhető, és könnyen hozzáférhet a nehezen elérhető helyekhez is.Hogyan kell használni a kerék tisztító kefét?<br />\n<br />\n<br />\n										A tisztító szert a gumira kell permetezni, illetve a kefe sörtéire<br />\n<br />\n<br />\n										Körkörös finom mozdulatokkal dolgozzuk el a tisztító szert<br />\n<br />\n<br />\n										Pár perc után letörölthető a tisztítószer és a feloldott szennyeződések<br />\n<br />\n<br />\n										Többször megismételhető a folyamat<br />\n<br />\n', 'Kerék tisztító kefe', '', '', '', 'kerek-tisztito-kefe'),
(2463, '', 'Univerzális spoiler féklámpával karbon mintás<br />\nSportos karbon mintás spoiler, amelyet minden autóra fel lehet szerelni.<br />\n<br />\nA ledszalagnak köszönhetően helyzetjelző és féklámpa funkcióval is rendelkezik. A helyzetjelző a csík teljes hosszában egyöntetű piros fény ként világít. A fékklámpa esetében szintén a teljes csík fénye felerősödik.<br />\n<br />\nA felhelyezése nagyon egyszerű, dupla kétoldalú ragasztóval van ellátva így egyszerűen csak fel kell ragasztani.<br />\n<br />\nA hossza 1.2méter így nagyobb autókra is felrakható. A hosszából a led fény miatt nem lehet vágni.<br />\n<br />\nA két végét esztétikus takaró elem zárja le.<br />\n<br />\n<br />\nUniverzális, minden típusra felrakható!<br />\nA spoiler univerzális, tehát bármelyik autóra fel lehet rakni.<br />\n<br />\nA teljes hossza 1.2 méter, a ledszalag miatt nem vágható rövidebbre.<br />\n<br />\nHa már nincs rá szükség, bármikor levehető az autóról, nem marad nyoma, mivel nincs csavarozva stb.<br />\n<br />\n<br />\nA felrakása nagyon egyszerű,házilag is könnyen megoldható!<br />\n<br />\n<br />\n 	Az autót le kell takarítani, zsírtalanítani kell<br />\n 	Oda kell mérni a spoilert, majd ha szükséges akkor méretre igazítani<br />\n 	A spoileren található ragasztócsíkról le kell szedni a védőfóliát és felragasztható a spoiler az autóra<br />\n<br />\nPrevious<br />\nNext', 'Univerzális spoiler féklámpával karbon mintás', '', '', '', 'univerzalis-spoiler-feklampaval-karbon-mintas'),
(2464, '', 'Kézi habosítóAz autómosókban jól ismert sűrű hab már otthon is elérhető! A kézi habosító pisztollyal gyorsan és egyszerűen moshatod le autód!A kanna két liter űrtartalmú, kiegészítve 2 féle szórófejjel.A két féle szórófej külön külön spriccelési módot biztosít. A szűk szórófej sima folyadék felhordásához való. Ezen állítható, hogy a permet milyen szélesen kerüljön szórásra.A szélesebb fej használható a habfürdő felhordásához. A habosító használata nagyon egyszerű, fel kell tölteni autósamponnal és vízzel. Ezt követően fel kell pumpálni a karral, és a kioldó gombot megnyomni. Újratöltéskor vagy a mosás befejezésekor a kioldó gomb felhúzásával a vákuum kioldható. <br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										2 liter űrtartalom<br />\n<br />\n<br />\n										2 féle szórófejjel<br />\n<br />\n<br />\n', 'Kézi habosító', '', '', '', 'kezi-habosito'),
(2465, '', 'Világító kéz autóbaElmondanád a véleményed a mögötted jövőnek? Egyetlen gombnyomással megteheted ezzel a világító kézzel. Az erőteljes ledeknek köszönhetően nappal is tökélesen látszanak a gesztusok. Alapesetben nem világít a kéz, bekapcsolásra pedig három különböző módon tud világítani. Felszerelése nagyon egyszerű,a ragasztós hátlappal ellátott tépőzárat kell feltenni az üvegre, és a kézre.Távirányítóval kapcsolható a 3 üzemmódA működéséhez szükséges 1db 23A elem(tartalmazza) és 3db  AA elem(nem tartalmazza). Csomag tartalma:<br />\nVilágító kéz tábla<br />\nTávirányító<br />\nÖntapadós tépőzár<br />\n1db 23A', 'Világító kéz autóba', '', '', '', 'vilagito-kez-autoba'),
(2466, '', 'Autó tisztító ecsetAz utóbbi időben nagyon népszerű lett az ecsetek használata az autó tisztításához . Az autó takarítás során olyan nehezen tisztítható helyekhez is oda lehet férni az ecsetekkel ahova más eszköz nem fér be.A külső és belső autótakarításhoz is lehet használni.Ha belső takarításra szeretnéd használni, az ecsetekkel tökéletesen lelehet tisztítani a szellőzőket és kapcsolókat a műszerfal és az ajtók minden részét. Külső használatnál az emblémákat, a felni minden részét és az ajtók illetve üvegek melletti vájatokat is.Az ecset sörtéi kör alakúak, így tökéletesen fel lehet vinni velük a megfelelő autóápolási szereket. A nyele erős műanyagból készült, kényelmesen bele illik a kézbe, a nyél tetején ki van alakítva egy luk, így felakasztva is tárolható ha éppen nem használod.Használat után egyszerűen meleg vízzel elmosható.Az ecset átmérője 45mm<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										 Puha sörtékkel<br />\n<br />\n<br />\n										Az alapos autó takarításhoz kialakítva<br />\n<br />\n<br />\n		A  tisztító kefét már csomagban is megvásárolhatod nálunk! ', 'Autó tisztító ecset', '', '', '', 'auto-tisztito-ecset'),
(2467, '', 'Kiegészítő eledel kutyák részére. Összetétel: csirkemell (65%), kukorica keményítő, hal (12%), glicerin, szorbitol, ásványi anyagok. Analitikai összetevők: nyersfehérje 28%, nyershamu 3%, nyerszsír 2%, nyersrost 0,5%, nedvesség 25%. Az állat előtt mindig legyen friss, tiszta ivóvíz!<br />\n', 'Trixie Jutalomfalat Premio hal+csirke pálcika 80gr', '', '', '', 'trixie-jutalomfalat-premio-hal+csirke-palcika-80gr'),
(2468, '', 'Kiegészítő eledel macskák számára. Összetevők: hús és állati melléktermékek (95%, 6% bárány, 6% pulyka), ásványok, yucca schidigera. Analitikai összetevők: Fehérje 33,5%, Zsírtartalom 20%, Nyershamu 10%, Nyersrost 2%, Nedvességtartalom 28%. Adalékanyagok (táplálkozási adalékanyagok): Taurin 1.000 mg. Technológiai adalékanyagok: Antioxidánsok, tartósítszerek. Érzékszervei adalékanyagok: Színezékek. Hozzáadott cukor nélkül. Gluténmentes. Az állat előtt mindig legyen friss tiszta ivóvíz. Csak takarmányozási célra! Jutalomfalatként adható a főétkezések között. Lejárati idő(hó/év) gyártási tételszám: lásd a csomagolásra nyomtatva. Származási hely: Kína.  Forgalmazza: Alpha-Vet Állatgyógyászati Kft., 1194 Budapest Hofherr A. u. 42, vevoszolgalatbp@alpha-vet.hu', 'Trixie Jutalomfalat Premio Quadro-Stick Bárány/Pulyka 5x5gr', '', '', '', 'trixie-jutalomfalat-premio-quadro-stick-baranypulyka-5x5gr'),
(2469, '', 'Kiegészítő eledel macskák részére lazaccal és pisztránggal (snack). 0% cukor, gluténmentes. Összetétel: hús és állati származékok, hal és hal eredetű származékok (beleértve 6% lazac, 6% pisztráng), ásványi anyagok, yucca schidigera. Analitikai összetevők: fehérje 33,5%, zsír 20,0%, nyershamu 10,0%, nyersrost 28,0%, nedvesség 10%. Adalékanyagok: tápértékkel rendelkező adalékanyagok: taurine 1.000mg. Technológiai adalékanyagok: antioxidánsok. Adagolás: jutalomként naponta adható. Mindig biztosítson friss, tiszta ivóvizet kedvence részére!', 'Trixie Jutalomfalat Premio Quadro-Stick Lazac/Pisztráng 5x5gr', '', '', '', 'trixie-jutalomfalat-premio-quadro-stick-lazacpisztrang-5x5gr'),
(2470, '', 'Sonax Extreme Autósampon koncentrátum 2in1<br />\nA sonex autósampon tökéletes választás egy általános autómosáshoz. Használható a fényezett elemeken, gumi és műanyag felületeken illetve az üvegeken is.<br />\n<br />\nHatékonyan old fel minden szennyeződést, és a mosást követően foltmentes száradást biztosít.<br />\n<br />\nA koncentrátumból sokkal kevesebb kell mint egy sima autósamponból, hiszen ez nincs felhigítva egyáltalán.<br />\n<br />\nAz általános szennyeződéseken kívül hatásos rovar maradványok, madárürülék és mindenféle zsír illetve növényi nedv ellen.<br />\n<br />\nŰrtartalom: 1liter<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 1 Literes kiszerelés<br />\n 	Vissza zárható kupakkal<br />\n', 'Autósampon koncentrátum Sonax Xtreme', '', '', '', 'autosampon-koncentratum-sonax-xtreme'),
(2471, '', 'Műszerfal tisztító és ápoló vanilia illattal<br />\nA műszerfal és a belső műanyagok tisztán tartása és ápolása fontos feladat, hiszen ezt látjuk minden alkalommal amikor beülünk az autóba.<br />\n<br />\nEz a szer alkalmas az autó belterének tisztítására. Könnyedén lehozza a koszt és a port a belső elemekről<br />\n<br />\nEmellett ápolja és védőréteggel vonja be a műszerfalat és a belső részt.<br />\n<br />\nVanilia illatú, így használata után kellemes illat marad az autóban.<br />\n<br />\nŰrtartalom:500ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 500ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a műszerfal ápoló és tisztító szert?<br />\nA műszerfal és a belső kárpitok tisztítására lett kifejlesztve ez a szer. Kíméletesen mégis hatékonyan lehet vele letakarítani a belső műanyagokat. Nem csak a műszerfalra de az összes belső kárpirta és műanyag elemre is használható.<br />\n<br />\nKellemes vaníllia illatot hagy maga után.<br />\nHogyan kell használni a műszerfal ápoló és tisztító szert?<br />\n<br />\n<br />\n 	A műszerfal tisztítót lehet közvetlenül a kárpitra is fújni, vagy egy mikroszálas rongyra<br />\n 	A szert el kell dolgozni a tisztítandó felületen<br />\n 	Többször megismételhető a folyamat<br />\n<br />\nA  műszerfalápolót már csomagban is megvásárolhatod nálunk! ', 'Műszerfal tisztító és ápoló spray vanilia illattal', '', '', '', 'muszerfal-tisztito-es-apolo-spray-vanilia-illattal'),
(2472, '', 'Szélvédő és üveg tisztító sprayÜveg felületek tisztítására kifejlesztett spray. Kiemeleten fontos, hogy az üvegek tiszták és teljesen átláthatóak legyenek az autóban és semmi ne zavarja a kilátást.A használata nagyon egyszerű, a pumpás szórófejjel egy mikroszálas törlőkendőre kell fújni és ezzel áttörölni az üvegeket, vagy közvetlenül permetezhető az üvegre és ezt követően szárazra törölhetőPárásodásgátló összetevőt tartalmaz, így az áttörölt üveg felületek nehezebben párásodnak be.Nem csíkoz, nem hagy nyomot a felületen, a tisztítószer elpárolog használat utánŰrtartalom: 500ml<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Kiadós 500ml kiszerelés<br />\n<br />\n<br />\n										Vissza zárható szórófejjel<br />\n<br />\n<br />\n		Mire lehet használni a szélvédő és üveg tisztító  szert?A q11 üveg tisztító sprayvel kényelmesen és hatékonyan lehet megtisztítani a szélvédőket,tükröket és minden üveget az autóba.Hogyan kell használni a szélvédő és üveg tisztító  szert?<br />\n<br />\n<br />\n										Az üvegtisztítót az üvegfelületekre kell permetezni<br />\n<br />\n<br />\n										Ezt követően átkell törölni az üveg felületét, hogy a felesleg lekerüljön róla.<br />\n<br />\n<br />\n										Többször megismételhető a folyamat<br />\n<br />\n', 'Szélvédő és üveg tisztító spray', '', '', '', 'szelvedo-es-uveg-tisztito-spray'),
(2473, '', 'Gumiápoló sprayA gumik is igénylik a megfelelő tisztítást és ápolást. Ehhez érdemes olyan szert használni ami kimondottan gumikhoz lett kialakítva. Így biztosak lehetünk benne, hogy segíti a gumik állapotának megtartását és optikailag is hozzá tesz az autó megjelenéséhez.A Q11 Gumiápoló hatékonyan tisztítja, fényesíti és védi a gumiabroncsokat, visszaállítja a szín eredeti mélységét és intenzitását.A használata elött alaposan le kell takarítani a gumikat, és leszárítani.<br />\nA gumiápolót a szórófejjel egyszerűen be kell permetezni, pár percig rajta hagyni a felületen.<br />\nEzt követően átlehet törölni a gumi felületét, hogy a felesleg lekerüljön róla. Űrtartalom: 500<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Kiadós 500ml kiszerelés<br />\n<br />\n<br />\n										Vissza zárható szórófejjel<br />\n<br />\n<br />\n		Mire lehet használni a gumiápoló szert?A gumiápoló szer a gumik és műanyagok ápolására és tisztítására lett kifejlesztve.<br />\nKülső és belső elemekre is használható.<br />\nPéldául az autókerék oldal falát érdemes vele lekezelni, illetve az ajtó kérdegumikat is.&amp;nbsp;<br />\nFelfrissítí és ápolja a gumi felületeket. Fényes és mély színű felületet ad nekik, illetve védő réteggel vonja be őket.Hogyan kell használni a gumiápoló szert?<br />\n<br />\n<br />\n										A használata elött alaposan le kell takarítani a gumikat, és leszárítani.<br />\n<br />\n<br />\n										A gumiápolót a szórófejjel egyszerűen be kell permetezni, pár percig rajta hagyni a felületen.<br />\n<br />\n<br />\n										Ezt követően átkell törölni a gumi felületét, hogy a felesleg lekerüljön róla.<br />\n<br />\n<br />\n										Többször megismételhető a folyamat<br />\n<br />\n<br />\n		A  gumiápoló sprayt már csomagban is megvásárolhatod nálunk! ', 'Gumiápoló spray', '', '', '', 'gumiapolo-spray'),
(2474, '', 'Bogároldó spray<br />\nA karosszériára tapadt rovarmaradványok és egyéb szennyeződések nagyon nehezen takaríthatóak le. Érdemes a megfelelő szerrel feloldani ezeket a szennyeződéseket. Így elkerülhető hogy össze karcoljuk vele a karosszériát.<br />\n<br />\nA Q11 bogároldó speciális összetételének köszönhetően percek alatt feloldja  a már odaszáradt rovarmaraványokat is.<br />\n<br />\nÜveg-, lakk-, műanyag- és gumifelületekre is alkalmazható, nem marja meg a felületüket.<br />\n<br />\nA bogároldó használata nagyon egyszerű, csak fel kell permetezni az autóra és várni pár percet. A kiemelt részeket mint a tükrök burkolatát és az autó első lökhárítókat érdemes több rétegben befújni, mivel itt tapad meg a legtöbb bogár maradvány.<br />\n<br />\nEzután lemoshatóak a maradványok.<br />\n<br />\nA bogároldó speciális összetételének köszönhetően alkalmas egyéb szennyeződések például madárürülék stb feloldására is.<br />\n<br />\nŰrtartalom: 500ml<br />\n<br />\n/*! elementor - v3.6.1 - 23-03-2022 */<br />\n.elementor-widget.elementor-icon-list--layout-inline .elementor-widget-container{overflow:hidden}.elementor-widget .elementor-icon-list-items.elementor-inline-items{margin-right:-8px;margin-left:-8px}.elementor-widget .elementor-icon-list-items.elementor-inline-items .elementor-icon-list-item{margin-right:8px;margin-left:8px}.elementor-widget .elementor-icon-list-items.elementor-inline-items .elementor-icon-list-item:after{width:auto;left:auto;right:auto;position:relative;height:100%;border-top:0;border-bottom:0;border-right:0;border-left-width:1px;border-style:solid;right:-8px}.elementor-widget .elementor-icon-list-items{list-style-type:none;margin:0;padding:0}.elementor-widget .elementor-icon-list-item{margin:0;padding:0;position:relative}.elementor-widget .elementor-icon-list-item:after{position:absolute;bottom:0;width:100%}.elementor-widget .elementor-icon-list-item,.elementor-widget .elementor-icon-list-item a{display:-webkit-box;display:-ms-flexbox;di