ms{-webkit-box-pack:start;-ms-flex-pack:start;justify-content:flex-start}.elementor-widget.elementor-mobile-align-left .elementor-icon-list-item,.elementor-widget.elementor-mobile-align-left .elementor-icon-list-item a{-webkit-box-pack:start;-ms-flex-pack:start;justify-content:flex-start;text-align:left}.elementor-widget.elementor-mobile-align-right .elementor-icon-list-items{-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end}.elementor-widget.elementor-mobile-align-right .elementor-icon-list-item,.elementor-widget.elementor-mobile-align-right .elementor-icon-list-item a{-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end;text-align:right}.elementor-widget:not(.elementor-mobile-align-right) .elementor-icon-list-item:after{left:0}.elementor-widget:not(.elementor-mobile-align-left) .elementor-icon-list-item:after{right:0}}<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 500ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a bogároldó szert?<br />\nA Q11 bogároldó speciális összetételének köszönhetően percek alatt feloldja  a már odaszáradt rovarmaraványokat is.<br />\n<br />\nÜveg-, lakk-, műanyag- és gumifelületekre is alkalmazható, nem marja meg a felületüket.<br />\nHogyan kell használni a bogároldó szert?<br />\n<br />\n<br />\n 	A tisztításra váró felületet be kell permetezni a szerrel<br />\n 	4-5 percig hagyni kell, hogy kifejtse hatását<br />\n 	Ezt követően lelehet mosni a felületét<br />\n 	Többször megismételhető a folyamat<br />\n', 'Bogároldó spray', '', '', '', 'bogaroldo-spray'),
(2475, '', 'Bőrápoló sprayA bőrüléseket és bőrkárpitokat rendszeresen tisztítani és ápolni szükséges, hogy ne repedezzenek meg és ne keményedjen ki a felületük. A bőrápoló szerek közül kiemelkedő ár érték arányú a Q11 bőrápolója.Természetes viaszt és felület aktív anyagokat tartalmaz, ennek köszönhetően a bőr még puhább és élénkebb színűvé válik.Por és nedvesség taszító réteget képez, így nehezebben koszolódnak vissza a bőrfelületek.Nem csak bőrülések és kárpitok de bármilyen más bőr anyagú termék tisztítására is kiválóan alkalmas. Akár táskákról kabátokról van szó, használható a bőrápoló spray.A készítmény kellemes &amp;#34;új bőr&amp;#34; illatot ad a tisztított felületnek.A használata egyszerű és kényelmes. A bőrápolót egy mikroszálas törlőkendőbe kell permetezni majd ezzel áttörölni a bőr felületet. Szükség szerinte ez többször megismételhető.<br />\nA nagyobb igénybevételű bőr kárpitoknál mint a könyöklő illetve az ülések, érdemes bőr tisztító kefével is átdolgozni a felületet, hogy fellazítson minden szennyződést.<br />\nNagyobb felületeken érdemes közvetlenül a bőrre is fújni a szerből és így áttörölni.Űrtartalom: 500ml<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Kiadós 500ml kiszerelés<br />\n<br />\n<br />\n										Vissza zárható szórófejjel<br />\n<br />\n<br />\n		ítja és ápolja a bőr felületeket!Természetes viaszt és felület aktív anyagokat tartalmaz, ennek köszönhetően a bőr még puhább és élénkebb színűvé válik.A bőrápoló használatát követően a bőr kellemes illatú.A por illetve nedvesség taszító rétegnek köszönhetően nehezebben koszolódik be őjra. <br />\n<br />\n		Bőrápoló spray használata&amp;nbsp;A használata a szórófejnek köszönhetően kényelmes és gyors.<br />\n<br />\n<br />\n										A bőrápolót fújd közvetlenül a bőrre, vagy egy mikroszálas kendőre<br />\n<br />\n<br />\n										Töröld át a kárpitot amíg el nem tűnik a bőrápoló<br />\n<br />\n<br />\n										Ezt többször megismételheted ha igényli a bőr felülete<br />\n<br />\n<br />\n<br />\n		A  bőrápoló és tisztító sprayt már csomagban is megvásárolhatod nálunk! ', 'Bőrápoló spray', '', '', '', 'borapolo-spray'),
(2476, '', 'Műanyagápoló és felújító spray<br />\nA műanyag elemek is igénylik a megfelelő tisztítást és ápolást. Ehhez érdemes olyan szert használni ami kimondottan erre lett kialakítva.<br />\n<br />\nA Q11 műanyagápoló és felújító spray az ideális megoldás erre a feladatra. A termékben található összetevők felfrissítik a műanyag elemeket, visszaadják az eredeti színüket, és eltávolítják a szennyeződéseket. A spray használata rendkívül egyszerű, így a műanyag felületek karbantartása és tisztítása gyorsan és hatékonyan elvégezhető.<br />\n<br />\nA műanyagápoló és felújító spray használata nagyon sokféle műanyag felületre alkalmazható. A belső elemekre is használható, mint például a műszerfal és az ajtópanelek, de külső használatra is tökéletes. A lökhárítók, tükör körüli műanyagok és díszlécek felújítására is alkalmas. A sprayben található összetevők ápolják a műanyag felületeket és megakadályozzák azok sérülését.<br />\n<br />\nEz a spray tökéletes választás a műanyag elemek tisztítására és ápolására.<br />\n<br />\nA benne található összetevők felfrissítik  a műanyag elemeket, és visszaadják a színét. Használható belső elemekre is mint például a műszerfal és az ajtópanelek, de külső használatra is megfelelő. A lökhárítók, tükör körüli műanyagok és díszlécek felújítására is alkalmas.<br />\n<br />\nŰrtartalom: 500ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 500ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a műanyag ápoló és felújító szert?<br />\nA szer használható a jó állapotú műanyagok ápolására és tisztítására, illetve használható a már kopott és elöregedett műanyagok felújítására, felfrissítésére.<br />\n<br />\nKülső és belső elemekre is használható.<br />\n<br />\nPéldául a műszerfal és az ajtópanelek felülete lökhárítók, tükör körüli műanyagok és díszlécek felújítására is alkalmas.<br />\nHogyan kell használni a műanyag ápoló és felújító szert?<br />\n<br />\n<br />\n 	A használata elött alaposan le kell takarítani a gumikat, és leszárítani.<br />\n 	A gumiápolót a szórófejjel egyszerűen be kell permetezni, pár percig rajta hagyni a felületen.<br />\n 	Ezt követően átkell törölni a gumi felületét, hogy a felesleg lekerüljön róla.<br />\n 	Többször megismételhető a folyamat<br />\n<br />\nA  műszerfalápolót már csomagban is megvásárolhatod nálunk! ', 'Műanyagápoló és felújító spray', '', '', '', 'muanyagapolo-es-felujito-spray'),
(2477, '', 'Kárpittisztító spray<br />\nAutókárpit és autószőnyeg tisztítására kifejlesztett szer, amely összegyűjti a porszemeket és újszerűvé varázsolja az autó belterét.<br />\n<br />\nGyorsan és hatékonyan lehet vele a kárpitokat kitisztítani. A MultiAction formulának köszönhetően felold minden szennyeződést. Ezt követően könnyedén kitakarítható a kárpitokba bele ragadt kosz.<br />\n<br />\nHasználata egyszerű és kényelmes.<br />\nA kárpittisztítót a felületre kell permetezni, majd pár perc várakozás után kárpittisztító kefével vagy mikroszálas ronggyal át kell dörzsölni.<br />\n<br />\nŰrtartalom:500ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 500ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a kárpittisztító szert?<br />\nAz autó kárpitjai gyakran foltosak, koszosak lesznek a napi használattól. Ehhez lett kifejlesztve ez a kárpittisztító szer. Könnyedén feloldja a szövetekbe ragadt koszt és foltokat.<br />\n<br />\nA kárpitok általános felfrissítésére is alkalmas.<br />\nHogyan kell használni a kárpittisztító szert?<br />\n<br />\n<br />\n 	A használata elött érdemes kiporszivózni a szövetet<br />\n 	A kárpit tisztítóval be kell permetezni a tisztítandó felületet<br />\n 	Pár perc után átkell dörzsölni egy kárpit tisztító kefével vagy mikroszálas ronggyal<br />\n 	Többször megismételhető a folyamat<br />\n<br />\nA kárpit tisztító sprayt már csomagban is megvásárolhatod nálunk! ', 'Kárpittisztító spray', '', '', '', 'karpittisztito-spray'),
(2478, '', ' Felni tisztító sprayA felnik tisztítása egy alapvető dolog autómosáskor. Érdemes olyan szert alkalmazni ami kimondottan felnik tisztítására alkalmas, mivel ezeknek olyan az összetétele ami a felnin található réteg ellen lett kifejlesztve.A q11 felni tisztító a lerakodott fékport és szennyeződéseket könnyedén feloldja. A felnit alaposan be kell permetezni vele, a szer másodperceken belül elkezd hatni. A feloldott kosz elválik a felni felületétől és könnyedén lemosható róla.Ha nagyon koszos a felni akkor többször is lehet alkalmazni, illetve felni tisztító kefe használata ajánlott. Ezzel belehet juttatni mindenhova a szert illetve az erőteljesebben letapadt részeket is fellazítja.Összetételének köszönhetően az alapos tisztítás után is taszítja a port és szennyeződéseket, nehezebben koszolódik be újra a felni.Alufelni és lemezfelni tisztítására is alkalmas, nincs maró hatása!Űrtartalma:500<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Kiadós 500ml kiszerelés<br />\n<br />\n<br />\n										Vissza zárható szórófejjel<br />\n<br />\n<br />\n		Mire lehet használni a felni tisztító szert?Alufelni és lemezfelni teljeskörű tisztítására is alkalmas, nincs maró hatása!<br />\nKönnyedén feloldja a felnire tapadt fékport és szennyeződéseket.Hogyan kell használni a műanyag ápoló és felújító szert?<br />\n<br />\n<br />\n										Egyenletesen be kell fújni a felni felületét<br />\n<br />\n<br />\n										 4-5percig kell fent hagyni, amíg kifejti hatását<br />\n<br />\n<br />\n<br />\n										Érdemes felni tisztító kefével áttörölni, hogy az erőteljesebb kosz réteg is fellazuljon<br />\n<br />\n<br />\n<br />\n<br />\n										Ezután lemosható a szer<br />\n<br />\n<br />\n<br />\n										Többször megismételhető a folyamat<br />\n<br />\n<br />\n		A  felni tisztító sprayt már csomagban is megvásárolhatod nálunk! ', 'Felni tisztító spray', '', '', '', 'felni-tisztito-spray'),
(2479, '', 'FELNI TISZTÍTÓ SPRAY Bloody<br />\nA Bloody felni tisztító egy különleges formulával lett kialakítva, így a fékporral és egyéb fém részecskékkel reakcióba lép. Ahogy hat a szer, úgy folyamatosan lilul be a felni tisztító és maradéktalanul feloldja a felnire tapadt koszt.<br />\n<br />\nA felnik tisztítása egy alapvető dolog autómosáskor. Érdemes olyan szert alkalmazni ami kimondottan felnik tisztítására alkalmas, mivel ezeknek olyan az összetétele ami a felnin található réteg ellen lett kifejlesztve.<br />\n<br />\nA q11 felni tisztító a lerakodott fékport és szennyeződéseket könnyedén feloldja. A felnit alaposan be kell permetezni vele, a szer másodperceken belül elkezd hatni. A feloldott kosz elválik a felni felületétől és könnyedén lemosható róla.<br />\n<br />\nHa nagyon koszos a felni akkor többször is lehet alkalmazni, illetve felni tisztító kefe használata ajánlott. Ezzel belehet juttatni mindenhova a szert illetve az erőteljesebben letapadt részeket is fellazítja.<br />\n<br />\nÖsszetételének köszönhetően az alapos tisztítás után is taszítja a port és szennyeződéseket, nehezebben koszolódik be újra a felni.<br />\n<br />\nŰrtartalma:500ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 500ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a felni tisztító szert?<br />\nA Bloody felni tisztítószer különlegessége, hogy kémiai reakcióba lép a fékporban lévő fémreszelékkel. Ennek mellékhatása a lila szín miközben dolgozik a szer.<br />\n<br />\nErőteljesen oldja fel a felnire tapad szennyeződést.<br />\n<br />\nAlufelni és lemezfelni tisztítására is alkalmas, nincs maró hatása!<br />\n<br />\nA karosszéria más részeire is használható, kerékiveknél és olyan helyeken ahol röprozsda rakódott le.<br />\n<br />\n<br />\nHogyan kell használni a felni tisztító szert?<br />\n<br />\n<br />\n 	Alaposan be kell permetezni vele a felnit<br />\n 	4-5percig kell fent hagyni, amíg kifejti hatását és elkezd belilulni a szer<br />\n 	Érdemes felni tisztító kefével áttörölni, hogy az erőteljesebb kosz réteg is fellazuljon<br />\n 	Ezután lemosható a szer<br />\n 	Többször megismételhető a folyamat<br />\n<br />\nA  felni tisztító sprayt már csomagban is megvásárolhatod nálunk! ', 'Felnitisztító spray', '', '', '', 'felnitisztito-spray'),
(2480, '', 'Bőrápoló krém<br />\nA bőrülések és bőrkárpitok kényesebbek mint a szövetek. Folyamatos törődést igényelnek, azonban ha megfelelően vannak tisztítva akkor hosszú ideig tökéletes állapotban maradnak.<br />\n<br />\nA bőrápoló krém egyszerre tisztítja és ápolja a bőr üléseket illetve kárpitokat. Tökéletes választás egy általános tisztításhoz mivel a bőr felületéről leszedi a szennyeződést, de anyagának köszönhetően táplálja is az anyagot.<br />\n<br />\nKrém szerű az állaga, mikroszálas ronggyal érdemes felvinni a bőrkárpitra és körkörös mozdulatokkal áttörölni azokat.<br />\n<br />\nA tisztítás mellett egy védőréteget is képez a bőrfelületen így nehezebben koszolódik be.<br />\n<br />\nA krém fresh leather(friss bőr) illatú.<br />\n<br />\nŰrtartalma:300ml<br />\nHogyan kell használni a bőrápoló szert?<br />\n<br />\n<br />\n 	Fújd rá közvetlenül a bőrfelületre vagy egy mikroszálas kendőre<br />\n 	A bőrápoló felvitele után alaposan átkell törölgetni az adott felületet egy mikroszálas kendővel vagy bőrápoló kefével<br />\n 	Többször megismételhető a folyamat<br />\n<br />\nMire lehet használni a bőrápoló szert?<br />\nA bőrápoló szer alkalmas minden bőrkárpit megtisztítására és felfrissítésére.<br />\n<br />\nA benne található tisztítószerek kíméletesen feloldják a bőrfelületre tapadt szennyeződéseket, így könnyen letörölhetőek<br />\n<br />\nA méhviasz tartalmának köszönhetően egy védőréteggel is bevonja a bőrt, melytől nehezebben koszolódik be és a vízlepergető hatása is jobb lesz.<br />\n<br />\nA bőrápoló szer kellemes friss bőr illatú.<br />\nA  bőrápoló és tisztító sprayt már csomagban is megvásárolhatod nálunk! ', 'Bőrápoló krém', '', '', '', 'borapolo-krem');
