(2484, '', 'Autóillatosító Epres Margarita<br />\nDr Marcus autóillatosító kellemes Epres Margarita illatban. A Dr Marcus autóillatosító család legújabb sorozata a koktélok illatait hozza el nekünk.<br />\n<br />\nA Epres Margarita egy kellemes epres édeskés mix', 'Autóillatosító Epres Margarita', '', '', '', 'autoillatosito-epres-margarita'),
(2485, '', 'Sport kipufogóvég karbon mintásSportos kipufogóvég rozsdamentes acélból, ami szinte minden autóra felszerelhető.A felfogatása csavarokkal történik, nem szükséges hozzá átalakítani vagy heggeszteni a gyári kipufogóvéget.Az autó megjelenésén sokat dob ha a gyári rozsdás kipufogóvég helyett egy sportos csillogó vég látszik ki. Nincs motor köbcenti, üzemanyag vagy egyéb megkötés hogy milyen típusokhoz jó, így tetszés szerint bármelyik verziót választhatod.Az anyaga rozsdamentes polírozott acél, így mindig csillogó marad, illetve könnyen takarítható az autómosás alkalmával<br />\n<br />\n<br />\n										Heggesztés nélkül felrakható<br />\n<br />\n<br />\n										Rozsdamentes anyagból<br />\n<br />\n<br />\n										Univerzális típus!<br />\n<br />\n<br />\n		Könnyen felszerelhető!A felszerelése házilag is könnyedén megoldható, csavarokkal lehet rögzíteni. A gyári kipufogóvéget nem kell átalakítani, simán a meglévő csőre lehet felrakni és a csavarok ehhez fogják hozzáA csavarok az autó alól nem látszódnak ki, csak a sport kipufogóvég ami láthatóUniverzális típusMinden 48-65mm-es kipufogócsőre felszerelhető, a csavarokkal állítható a mérete- Szélesség: 90mm<br />\n- Magasság: 70mm<br />\n- Hosszúság: 120/150mm<br />\n-Csatlakozó cső átmérő (állítható):48-65mmMinden 48-65mm-es kipufogócsőre felszerelhető<br />\n			/*! elementor - v3.12.0 - 29-03-2023 */<br />\n.elementor-widget-image-carousel .swiper,.elementor-widget-image-carousel .swiper-container{position:static}.elementor-widget-image-carousel .swiper-container .swiper-slide figure,.elementor-widget-image-carousel .swiper .swiper-slide figure{line-height:inherit}.elementor-widget-image-carousel .swiper-slide{text-align:center}.elementor-image-carousel-wrapper:not(.swiper-container-initialized) .swiper-slide,.elementor-image-carousel-wrapper:not(.swiper-initialized) .swiper-slide{max-width:calc(100% / var(--e-image-carousel-slides-to-show, 3))}<br />\n<br />\n												Előző<br />\n												Követke