(2486, '', 'Defekt javító készlet<br />\nAutó motor és minden járműtípus gumijához megfelelő defekt javítü szett<br />\n<br />\nA gumiköppenyen képződött lukat tömíti be a benne található speciális gumis anyag, úgynevezett kukac.<br />\n<br />\nA gumiba a recés szerszámmal először ki kell alakítani a kukac helyét, ezt követően a lukas végűvel behelyezni a lukba. A kukacot be kell kenni a mellékelt ragasztóval a behelyezés elött<br />\nA defektjavító szett tartalma:<br />\n-2 telepítő szerszám<br />\n-ragasztó<br />\n-5 kukac<br />\n<br />\n 	Könnyen használható!<br />\n 	Hordozható<br />\n<br />\nKönnyű és gyors megoldás a defektre!<br />\nA defektet könnyen és gyorsan kilehet javítani ezzel a készlettel.<br />\n<br />\nA gumisok is előszeretettel használják a gumiköppenyek javaítására, mivel ha olyan jellegű a sérülés, maga a gumi még használható.<br />\n<br />\n<br />\nA szett tartlmaz minden szükséges összetevőt<br />\n-2db telepítő szerszám, amellyel ki lehet alakítani a javító kukac helyét, illetve be lehet helyezni<br />\n-ragasztó, amely kimondottan gumijavításhoz lett kialakítva<br />\n-5 kukac amelyet a kialakított lukba lehet rakni<br />\n<br />\n', 'Defekt javító készlet', '', '', '', 'defekt-javito-keszlet'),
(2487, '', 'Sport kipufogóvég<br />\nSportos kipufogóvég rozsdamentes acélból, ami szinte minden autóra felszerelhető.<br />\n<br />\nAz autó megjelenésén sokat dob ha a gyári rozsdás kipufogóvég helyett egy sportos csillogó vég látszik ki. Nincs motor köbcenti, üzemanyag vagy egyéb megkötés hogy milyen típusokhoz jó, így tetszés szerint bármelyik verziót választhatod<br />\n<br />\nAz anyaga rozsdamentes polírozott acél, így mindig csillogó marad, illetve könnyen takarítható az autómosás alkalmával<br />\n<br />\n 	Heggesztés nélkül felrakható<br />\n 	Rozsdamentes anyagból<br />\n 	Univerzális típus!<br />\n<br />\nKönnyen felszerelhető!<br />\nA felszerelése házilag is könnyedén megoldható, csavarokkal lehet rögzíteni. A gyári kipufogóvéget nem kell átalakítani, simán a meglévő csőre lehet felrakni és a csavarok ehhez fogják hozzá<br />\n<br />\nA csavarok az autó alól nem látszódnak ki, csak a sport kipufogóvég ami látható<br />\n<br />\n<br />\nUniverzális típus<br />\nMinden 43-62mm-es kipufogócsőre felszerelhető, a csavarokkal állítható a mérete<br />\n<br />\n- Szélesség: 76mm<br />\n- Magasság: 70mm<br />\n- Hosszúság: 100/130mm<br />\n-Csatlakozó cső átmérő (állítható):43-62mm<br />\n<br />\nMinden 43-62mm-es kipufogócsőre felszerelhető<br />\n<br />\n', 'Sport kipufogóvég', '', '', '', 'sport-kipufogoveg'),
(2488, '', 'Sport kipufogóvég dupladupla sport kipufogóvég rozsdamentes acélból, ami szinte minden autóra felszerelhető.Az autó megjelenésén sokat dob ha a gyári rozsdás kipufogóvég helyett egy sportos csillogó vég látszik ki. Nincs motor köbcenti, üzemanyag vagy egyéb megkötés hogy milyen típusokhoz jó, így tetszés szerint bármelyik verziót választhatodAz anyaga rozsdamentes polírozott acél, így mindig csillogó marad, illetve könnyen takarítható az autómosás alkalmával<br />\n<br />\n<br />\n										Heggesztés nélkül felrakható<br />\n<br />\n<br />\n										Rozsdamentes anyagból<br />\n<br />\n<br />\n										Univerzális típus!<br />\n<br />\n<br />\n		Könnyen felszerelhető!A felszerelése házilag is könnyedén megoldható, csavarokkal lehet rögzíteni. A gyári kipufogóvéget nem kell átalakítani, simán a meglévő csőre lehet felrakni és a csavarok ehhez fogják hozzáA csavarok az autó alól nem látszódnak ki, csak a sport kipufogóvég ami látható<br />\n<br />\n		Univerzális típusMinden 38-48mm-es kipufogócsőre felszerelhető, a csavarokkal állítható a mérete- Szélesség: 178mm<br />\n- Magasság: 67mm<br />\n- Hosszúság: 214/230mm<br />\n-Csatlakozó cső átmérő (állítható):38-48mmMinden 38-48mm-es kipufogócsőre felszerelhető<br />\n', 'Sport kipufogóvég dupla', '', '', '', 'sport-kipufogoveg-dupla'),
(2489, '', 'Sport kipufogóvég feketeSportos kipufogóvég rozsdamentes acélból, ami szinte minden autóra felszerelhető.A felfogatása csavarokkal történik, nem szükséges hozzá átalakítani vagy heggeszteni a gyári kipufogóvéget.Az autó megjelenésén sokat dob ha a gyári rozsdás kipufogóvég helyett egy sportos csillogó vég látszik ki. Nincs motor köbcenti, üzemanyag vagy egyéb megkötés hogy milyen típusokhoz jó, így tetszés szerint bármelyik verziót választhatod.Az anyaga rozsdamentes polírozott acél, így mindig csillogó marad, illetve könnyen takarítható az autómosás alkalmával<br />\n<br />\n<br />\n										Heggesztés nélkül felrakható<br />\n<br />\n<br />\n										Rozsdamentes anyagból<br />\n<br />\n<br />\n										Univerzális típus!<br />\n<br />\n<br />\n		Könnyen felszerelhető!A felszerelése házilag is könnyedén megoldható, csavarokkal lehet rögzíteni. A gyári kipufogóvéget nem kell átalakítani, simán a meglévő csőre lehet felrakni és a csavarok ehhez fogják hozzáA csavarok az autó alól nem látszódnak ki, csak a sport kipufogóvég ami láthatóUniverzális típusMinden 43-62mm-es kipufogócsőre felszerelhető, a csavarokkal állítható a mérete- Szélesség: 76mm<br />\n- Magasság: 70mm<br />\n- Hosszúság: 100/130mm<br />\n-Csatlakozó cső átmérő (állítható):43-62mmMinden 43-62mm-es kipufogócsőre felszerelhető', 'Sport kipufogóvég fekete', '', '', '', 'sport-kipufogoveg-fekete'),
(2490, '', 'Autó ablak sötétítő fólia 60% 75x300cm<br />\nA sötétítő fóliáknak több előnye is van amiért érdemes használni őket. Nem csak optikailag dobja fel az autó megjelenését, de további hasznos tuladjonságai is vannak a fóliának.&amp;nbsp;<br />\nEz a fólia egy világos árnyalatú fólia, 60% a fényáteresztése.&amp;nbsp;<br />\nA fólia mérete miatt Foxpost/GLS/Packeta automatába nem tudjuk kiküldeni a csomagot. A csomagpontok és házhozszállítás elérhető a termékhez!1. Megvédi az autó belterét a felmelegedéstől&amp;nbsp;<br />\n<br />\nA sötétítő fóliának köszönhetően nehezebben melegszik fel az autó beltere. Nyáron is sokkal könnyebb lehűteni az autó utasterét.<br />\n2. Optikai tuning&amp;nbsp;<br />\nAz autóablak sötétítő fólia optikailag is sportosabbá teszik az autót. Egy jól megválasztott fekete vagy füst színű üveg rengeteget tud dobni az autó megjelenésén.&amp;nbsp;<br />\n3. Védelmet nyújt a feltörés ellen<br />\nA fóliázott ablakokon nem lehet belátni, így nem látni az esetlegesen bent hagyott értékeket, táskát lapopot stb.-t. Így elkerülhető hogy emiatt törjék fel az autót.&amp;nbsp;<br />\nA fizikai védelem mellett szól az az érv is, hogy a fóliázott üveget nehezebb betörni, illetve baleset során a széttört üveget rögzíti a fólia.<br />\n4. Védelmet nyújt az UV sugárzás ellen<br />\n<br />\nAz autóablak sötétítő fólia visszaveri a napsugarakat, így az UV sugárzást is meggátolja az ablakfólia. A műanyag elemek nem kapnak olyan mértékű UV sugárzást mint fólia nélkül. Így lassabban öregszik az anyaga a beltérnek.<br />\n<br />\nA mérete 300*75cm tehát akár hátsó ablakra, raktérre is megfelelő szélességű.<br />\nMihez használható a sötétítő ablakfólia?<br />\nAz ablakfóliákat bármilyen üvegfelületre fel lehet rakni. Autóüveg, lakókocsi, teherautó raktér ablak, üzletek és iroda ablakok.<br />\nMűbizonylattal nem rendelkezik!<br />\n<br />\n<br />\n										Könnyen,házilag is felrakható!<br />\n<br />\n<br />\n										300x75cm méretű<br />\n<br />\n<br />\n										UV álló anyagból<br />\n<br />\n<br />\n		Sötét fekete színEnnek a fóliának a fényáteresztő képessége: 60%<br />\nEz az ablakfólia egy kevésbé sötét, füstös színt ad az üvegeknek.<br />\n<br />\n		Könnyedén felrakható házilag is!Az autó szélvédőit alaposan le kell takarítani üveg tisztítóval.Ezt követően a fóliát be kell vizezni és felhelyezni az adott üvegre kívűlről. Így könnyen méretre lehet vágni a fóliát.Ha meg van a méret, akkor a védőfóliát le kell szedni a fólia belső feléről.Be kell vizezni a fóliát és az üveg felületet is ahova felrakásra kerül.A műanyag spatulával ki kell nyomni a fólia alól a vizet. Ha valahol buborék marad, vékony tűvel ki lehet szúrni.A fólia mellett műanyag spatula és penge is van, de érdemes egy profi fólia felrakó szettet beszerezni.Mihez ajánljuk az ablakfóliákat?Az ablakfóliákat bármilyen üvegfelületre fel lehet rakni. Autóüveg, lakókocsi, teherautó raktér ablak, üzletek és iroda ablakok.Ha ennél sötétebb fekete ablak fóliát keresel, akkor az 5%-s fóliát ajánljuk.Műbizonylattal nem rendelkezik<br />\n<br />\n		A fóliázáshoz hasznos kiegészítők:', 'Autó ablak sötétítő fólia 60% 75x300cm', '', '', '', 'auto-ablak-sotetito-folia-60-75x300cm'),
