zilag is felrakható!<br />\n<br />\n<br />\n										300x75cm méretű<br />\n<br />\n<br />\n										UV álló anyagból<br />\n<br />\n<br />\n		Sötét fekete színűA fólia erősségét, százalékban tüntetik fel a fóliák esetében. Ennek a fóliának a fényáteresztő képessége: 5%A lehető legsötétebb (fekete) ablak fólia, mindössze 5% a fényáteresztése.Az ablakfólia az optikai tuning mellett a védelem szempontjából is hasznos.<br />\n<br />\n		Könnyedén felrakható házilag is!Az autó szélvédőit alaposan le kell takarítani üveg tisztítóval.Ezt követően a fóliát be kell vizezni és felhelyezni az adott üvegre kívűlről. Így könnyen méretre lehet vágni a fóliát.Ha meg van a méret, akkor a védőfóliát le kell szedni a fólia belső feléről.Be kell vizezni a fóliát és az üveg felületet is ahova felrakásra kerül.A műanyag spatulával ki kell nyomni a fólia alól a vizet. Ha valahol buborék marad, vékony tűvel ki lehet szúrni.A fólia mellett műanyag spatula és penge is van, de érdemes egy profi fólia felrakó szettet beszerezni.Mihez ajánljuk az ablakfóliákat?<br />\nAz ablakfóliákat bármilyen üvegfelületre fel lehet rakni. Autóüveg, lakókocsi, teherautó raktér ablak, üzletek és iroda ablakok.<br />\nHa ennél világosabb&amp;nbsp; füst fekete ablak fóliát keresel, akkor a 30%-s fóliát ajánljuk.<br />\nMűbizonylattal nem rendelkezik<br />\n<br />\n		A fóliázáshoz hasznos kiegészítők:', 'Autó ablak sötétítő fólia 5% 75x300cm', '', '', '', 'auto-ablak-sotetito-folia-5-75x300cm'),
(2494, '', 'Valódi bőr kormányhuzat fekete varrássalKivó minőségű bőr kormányhuzat, amit fel kell varrni a kormányraA varrással egyedi dizájnt adhatunk neki, illetve a hagyományos fix kormányvédőkkel szemben ettől nem lesz vastagabb a kormány fogásaMiért jobb ez a típus mint a régi hagyományos kormányvédők?-Vékony az anyaga, nem vastagítja meg jelentősen a kormányt-Belülről hasított bőr az anyaga, így nem roncsolja a kormány anyagát-Kényelmes fogást biztosít, nem csúszik el a kormányon-Dizájnban messze a legprofibb megoldás! Minőségi fekete bőr a kiváló minőségű erős cérnával felvarrva..! Sikerülni fog a felvarrás?A kormányvédő úgy lett kialakítva, hogy kézügyesség nélkül is könnyedén fel lehessen varrni..A kormányvédőn található egy alapvarrás körbe, ebbe kell csak bele fűzni a cérnát. A varrás mentén szépen felfekszik a kormányra.A szett tartalmazza a cérnát, és a varrótűt is így semmilyen plusz felszerelésre nincsen szükség a felvarráshoz.A kormányvédő huzat szinte minden személyautó kormányára megfelelően felfekszikMérete alapján 10cm széles és 37-39cm átmérújű kormányra való.Mérete:37-39cm és 10cm széles így szinte minden személyautóra megfelelőPár típus amihez biztosan jó:alfa romeo: 145, 146, 147, 156, 159, 166, GTV<br />\naudi: 100 C4, 200, 80, A3, A4, A6, Q7, TT<br />\nbmw: E28, E30, E34, E36, E39, E46, E60, E90, E91, E92, Z3<br />\ncitroen: AX, berlingo, C2, C4, C4 grand picasso, C5, C8, evasion, xsara, xsara picasso<br />\ndaewoo: espero, lanos, leganza, nexia, nubira<br />\nfiat: brava, bravo, coupe, doblo, grande punto, linea, marea, palio, panda, punto, scudo, seicento, siena, stilo, ulysse<br />\nford: C-MAX, escort, fiesta, focus, fusion, galaxy, ka, mondeo, orion, puma, S-MAX, scorpio<br />\nhonda: accord, civic, concerto, CRX<br />\nhyundai: coupe<br />\niveco: dally<br />\nkia: rio, sportage<br />\nmazda: 6, MX5, MX6<br />\nmercedes: 123, 124, 190, A-osztály, C-osztály, E-osztály, ML, sprinter, vito, vaneo<br />\nmitsubishi: carisma, colt, galant, lancer<br />\nnissan: 200SX, almera, almera tino, pathfinder, primera<br />\nopel: astra, calibra, combo, corsa, frontiera, kadett, meriva, omega, senator, signum, sintra, tigra, vectra, vivaro, zafira<br />\npeugeot: 106, 206, 207, 208, 306, 307, 406, 407, 806, 807, expert, partner<br />\nrenault: 19, 21, clio, espace, kangoo, laguna, master, megane, safrane, scenic, trafic, twingo<br />\nseat: alhambra, altea, cordoba, ibiza, leon, toledo<br />\nskoda: fabia, favorit, felicja, octavia<br />\ntoyota: avensis, celica, corolla, MR2, RAV4, yaris<br />\nvolkswagen: caddy, corrado, golf, jetta, lupo, passat, polo, sharan, T5, touran, vento<br />\nvolvo: 40, 60, 70, 80, XC90<br />\n<br />\n<br />\n										Könnyen felvarrható házilag!<br />\n<br />\n<br />\n										Valódi bőr<br />\n<br />\n<br />\n										Kényelmes fogást biztosít<br />\n<br />\n<br />\n		Újítsd fel a kormányt olcsón házilagHa a kormány már elkopott, vagy jó állapotú de szeretnéd védeni az állapotát akkor a kormányvédő tökéletes megoldás.<br />\nA valódi bőr kormáynvédő huzat kényelmes és biztonságos fogást biztosít.&amp;nbsp;<br />\n<br />\n		Könnyen felvarrható házilagA kormányvédő huzaton elő van készítve a varrás helye körben. Ebbe kell belefűzni a mellékelt cérnát, így tapasztalat nélkül is könnyen felvarrható.A varrás egyenletes lesz, mivel adott a varrás minta.<br />\n<br />\n		Miért jobb ez a típus mint a régi hagyományos kormányvédők? -Vékony az anyaga, nem vastagítja meg jelentősen a kormányt-Belülről hasított bőr az anyaga, így nem roncsolja a kormány anyagát-Kényelmes fogást biztosít, nem csúszik el a kormányon-Dizájnban messze a legprofibb megoldás! Minőségi fekete bőr a kiváló minőségű erős cérnával felvarrva..!<br />\n<br />\n		Az kormányvédő huzat szett tartalma:<br />\n<br />\n<br />\n										Kormányvédő huzat<br />\n<br />\n<br />\n										Erősített cérna<br />\n<br />\n<br />\n										Varrótű<br />\n<br />\n<br />\n<br />\n		Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.', 'Kormányvédő huzat fekete', '', '', '', 'kormanyvedo-huzat-fekete'),
(2495, '', 'Mikroszálas törlőkendő csomag 4 féle<br />\nEz a csomag 4 féle mikroszálas törlőkendőből lett összeállítva, mindegyik típus másra használható. A színeknek köszönhetően könnyen megkülönböztethetőek.<br />\n<br />\nAz autó teljes külső és belső tisztítása megoldható ezzel a csomaggal. A belső műanyag elemekre, és üvegfelelületekre tartalmaz a csomag. A külső elemekhez szárító és polírozó kendő is van.<br />\n<br />\nA mikroszálas törlőkendők típusai: <br />\n<br />\n-Üveg felületekre<br />\n-Belső térre, műanyagok tisztítására<br />\n-Szárító kendő<br />\n-Polírozó kendő<br />\n<br />\nA mikroszálas kendők anyagát is több féle képpen lehet kialakítani, így más célt szolgál egy sűrűbb anyagú mint egy ritkább szövésű.<br />\n<br />\nMérete: 30*30cm<br />\n<br />\n&amp;nbsp;<br />\n<br />\n 	Könnyen használható!<br />\n 	30x30cm méretű<br />\n 	4 darabos kiszerelés<br />\n', 'Mikroszálas törlőkendő csomag 4 féle', '', '', '', 'mikroszalas-torlokendo-csomag-4-fele'),
(2496, '', 'Sport kipufogóvég fekete duplaDupla sport kipufogóvég rozsdamentes acélból, ami szinte minden autóra felszerelhető.Az autó megjelenésén sokat dob ha a gyári rozsdás kipufogóvég helyett egy sportos csillogó vég látszik ki. Nincs motor köbcenti, üzemanyag vagy egyéb megkötés hogy milyen típusokhoz jó, így tetszés szerint bármelyik verziót választhatodAz anyaga rozsdamentes polírozott acél, így mindig csillogó marad, illetve könnyen takarítható az autómosás alkalmával<br />\n<br />\n<br />\n										Heggesztés nélkül felrakható<br />\n<br />\n<br />\n										Rozsdamentes anyagból<br />\n<br />\n<br />\n										Univerzális típus!<br />\n<br />\n<br />\n		Könnyen felszerelhető!A felszerelése házilag is könnyedén megoldható, csavarokkal lehet rögzíteni. A gyári kipufogóvéget nem kell átalakítani, simán a meglévő csőre lehet felrakni és a csavarok ehhez fogják hozzáA csavarok az autó alól nem látszódnak ki, csak a sport kipufogóvég ami látható<br />\n<br />\n		Univerzális típusMinden 35-50mm-es kipufogócsőre felszerelhető, a csavarokkal állítható a mérete<br />\n- Szélesség: 30mm<br />\n- Magasság: 63mm<br />\n- Hosszúság: 215mm<br />\n-Csatlakozó cső átmérő (állítható):35-50mm<br />\nMinden 35-50mm-es kipufogócsőre felszerelhető<br />\n', 'Sport kipufogóvég dupla fekete', '', '', '', 'sport-kipufogoveg-dupla-fekete'),
(2497, '', '[vc_row][vc_column][vc_column_text]<br />\nSportlégszűrő <br />\nA sportlégszűrővel a teljesítménynövekedés mellett mélyebb sportosabb hangot is eltudunk érni, nagyobb átalakítás nélkül.<br />\n<br />\nA szűrőt az első használat elött be kell olajozni, majd a használat során rendszeresen tisztítani kell. Ehhez ajánljuk a sportlégszűrő tisztító és olajozó szettünket.<br />\n<br />\nA szett tartalmaz többféle torkolati gyűrűt is, így különböző méretű légszűrő csőre is felrakhatóak.<br />\n<br />\nLégszűrő mérete:<br />\nTeljes magasság - 160 mm<br />\nSzélesség lefelé - 155 mm<br />\nFelső szélesség - 118 mm<br />\n<br />\nHasználati utasítás:<br />\n<br />\nElső üzembe helyezés előtt be kell olajozni a légszűrőt, így képes megszűrni a levegőt.<br />\n<br />\n1. Előtisztítás: tisztítsa meg a légszűrőt egy puha kefével<br />\n2. Permetezze be a szűrőt a tisztítófolyadékkal és hagyja 10 percet hatni<br />\n3. Szárítás: nagy nyomású levegővel (pl. ventilátor) fújja ki a tisztítófolyadékot és a szennyeződéseket a szűrőből. Tilos a hajszárító használata, mert a szűrőt károsíthatja.<br />\n4. Olajozás: minden egyes tisztítás után olajozza be a szűrőt. A lépeseket 8-10 ezer km-ként ismételje, hogy pormentes levegőt biztosítson a motor számára. Ha poros úton közlekedik, akkor ajánlott 4 ezer km-kénti ellenőrzés, szükség esetén tisztítás.<br />\n<br />\nFigyelmeztetés! A sport levegőszűrőket off-road és gyorsulási versenyekhez használja. Nem használható repülő, vízi- és ipari járművekben.<br />\n<br />\n<br />\n<br />\nA légszűrő teste kék színű, a végein króm színű fém betéttel.<br />\n<br />\nA szűrő nagy felületű, így elegendő mennyiségű levegőt képes megszűrni nagy köbcentis motorok számára is.<br />\n<br />\n<br />\n<br />\nA légszűrő mellett szűkítőgyűrűket is tartalmaz a készlet. Így többféle méretű légszűrőhöz is könnyedén csatlakoztatható.<br />\nA szűkítőgyűrűkkel az alábbi méretekhez jó:<br />\n76mm - 70mm - 65mm - 60mm - 55 mm[/vc_column_text][/vc_column][/vc_row]', 'Sportlégszűrő', '', '', '', 'sportlegszuro'),
(2498, '', 'Sport l&amp;eacute;gszűrő&amp;nbsp;<br />\nA sport l&amp;eacute;gszűrővel a teljes&amp;iacute;tm&amp;eacute;nyn&amp;ouml;veked&amp;eacute;s mellett m&amp;eacute;lyebb sportosabb hangot is eltudunk &amp;eacute;rni, nagyobb &amp;aacute;talak&amp;iacute;t&amp;aacute;s n&amp;eacute;lk&amp;uuml;l. A szűrőt az első haszn&amp;aacute;lat el&amp;ouml;tt be kell olajozni, majd a haszn&amp;aacute;lat sor&amp;aacute;n rendszeresen tiszt&amp;iacute;tani kell. Ehhez aj&amp;aacute;nljuk a sport l&amp;eacute;gszűrő tiszt&amp;iacute;t&amp;oacute; &amp;eacute;s olajoz&amp;oacute; szett&amp;uuml;nket.<br />\nA szett tartalmaz t&amp;ouml;bbf&amp;eacute;le torkolati gyűrűt is, &amp;iacute;gy k&amp;uuml;l&amp;ouml;nb&amp;ouml;ző m&amp;eacute;retű l&amp;eacute;gszűrő csőre is felrakhat&amp;oacute;ak.<br />\nL&amp;eacute;gszűrő m&amp;eacute;rete:<br />\n<br />\nTeljes magass&amp;aacute;g - 160 mm<br />\nSz&amp;eacute;less&amp;eacute;g lefel&amp;eacute; - 155 mm<br />\nFelső sz&amp;eacute;less&amp;eacute;g - 118 mm<br />\n<br />\nAl&amp;aacute;bbi torkolati m&amp;eacute;retekhez j&amp;oacute;:<br />\n<br />\n76mm<br />\n70mm<br />\n65mm<br />\n60mm<br />\n55 mm<br />\n<br />\nHaszn&amp;aacute;lati utas&amp;iacute;t&amp;aacute;s:<br />\nElső &amp;uuml;zembe helyez&amp;eacute;s előtt be kell olajozni a l&amp;eacute;gszűrőt, &amp;iacute;gy k&amp;eacute;pes megszűrni a levegőt. 1. Előtiszt&amp;iacute;t&amp;aacute;s: tiszt&amp;iacute;tsa meg a l&amp;eacute;gszűrőt egy puha kef&amp;eacute;vel 2. Permetezze be a szűrőt a tiszt&amp;iacute;t&amp;oacute;folyad&amp;eacute;kkal &amp;eacute;s hagyja 10 percet hatni 3. Sz&amp;aacute;r&amp;iacute;t&amp;aacute;s: nagy nyom&amp;aacute;s&amp;uacute; levegővel (pl. ventil&amp;aacute;tor) f&amp;uacute;jja ki a tiszt&amp;iacute;t&amp;oacute;folyad&amp;eacute;kot &amp;eacute;s a szennyeződ&amp;eacute;seket a szűrőből. Tilos a hajsz&amp;aacute;r&amp;iacute;t&amp;oacute; haszn&amp;aacute;lata, mert a szűrőt k&amp;aacute;ros&amp;iacute;thatja. 4. Olajoz&amp;aacute;s: minden egyes tiszt&amp;iacute;t&amp;aacute;s ut&amp;aacute;n olajozza be a szűrőt.<br />\nA l&amp;eacute;peseket 8-10 ezer km-k&amp;eacute;nt ism&amp;eacute;telje, hogy pormentes levegőt biztos&amp;iacute;tson a motor sz&amp;aacute;m&amp;aacute;ra. Ha poros &amp;uacute;ton k&amp;ouml;zlekedik, akkor aj&amp;aacute;nlott 4 ezer km-k&amp;eacute;nti ellenőrz&amp;eacute;s, sz&amp;uuml;ks&amp;eacute;g eset&amp;eacute;n tiszt&amp;iacute;t&amp;aacute;s. Figyelmeztet&amp;eacute;s! A sport levegőszűrőket off-road &amp;eacute;s gyorsul&amp;aacute;si versenyekhez haszn&amp;aacute;lja. Nem haszn&amp;aacute;lhat&amp;oacute; rep&amp;uuml;lő, v&amp;iacute;zi- &amp;eacute;s ipari j&amp;aacute;rművekben.&amp;nbsp;<br />\nA l&amp;eacute;gszűrő teste fekete sz&amp;iacute;nű, a v&amp;eacute;gein kr&amp;oacute;m sz&amp;iacute;nű f&amp;eacute;m bet&amp;eacute;ttel. A szűrő nagy fel&amp;uuml;letű, &amp;iacute;gy elegendő mennyis&amp;eacute;gű levegőt k&amp;eacute;pes megszűrni nagy k&amp;ouml;bcentis motorok sz&amp;aacute;m&amp;aacute;ra is.<br />\nA l&amp;eacute;gszűrő mellett szűk&amp;iacute;tőgyűrűket is tartalmaz a k&amp;eacute;szlet. &amp;Iacute;gy t&amp;ouml;bbf&amp;eacute;le m&amp;eacute;retű l&amp;eacute;gszűrőh&amp;ouml;z is k&amp;ouml;nnyed&amp;eacute;n csatlakoztathat&amp;oacute;. A szűk&amp;iacute;tőgyűrűkkel az al&amp;aacute;bbi m&amp;eacute;retekhez j&amp;oacute;: 76mm - 70mm - 65mm - 60mm - 55 mm<br />\n<br />\n&amp;nbsp;', 'Sport légszűrő', '', '', '', 'sport-legszuro');
INSERT INTO `h207m_virtuemart_products_hu_hu` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(2499, '', 'Karbon fólia fekete 30x150cmA karbon fóliák az elmúlt években hatalmas népszerűségre tettek szert az autótuning világában. A külső és belső elemek optikai tuningjára is használható. Teljes autókat és belső tereket vagy csak egy egy elemet is be lehet vele vonni és rengeteget dob az autó megjelenésén.A fólia felhelyezése igényel némi rutint, de könnyen bele lehet jönni és házilag is felrakható. A karbon fólia légcsatornás kialakítású, így az esetlegesen fólia alatt maradt buborékokat sokkal könnyebb kinyomni alóla.Vastagsága: 90micron<br />\nHőállóság: -38C-110C<br />\nRagasztó típusa: Akril ragasztó<br />\n			/*! elementor - v3.6.1 - 23-03-2022 */<br />\n.elementor-widget.elementor-icon-list--layout-inline .elementor-widget-container{overflow:hidden}.elementor-widget .elementor-icon-list-items.elementor-inline-items{margin-right:-8px;margin-left:-8px}.elementor-widget .elementor-icon-list-items.elementor-inline-items .elementor-icon-list-item{margin-right:8px;margin-left:8px}.elementor-widget .elementor-icon-list-items.elementor-inline-items .elementor-icon-list-item:after{width:auto;left:auto;right:auto;position:relative;height:100%;border-top:0;border-bottom:0;border-right:0;border-left-width:1px;border-style:solid;right:-8px}.elementor-widget .elementor-icon-list-items{list-style-type:none;margin:0;padding:0}.elementor-widget .elementor-icon-list-item{margin:0;padding:0;position:relative}.elementor-widget .elementor-icon-list-item:after{position:absolute;bottom:0;width:100%}.elementor-widget .elementor-icon-list-item,.elementor-widget .elementor-icon-list-item a{display:-webkit-box;display:-ms-flexbox;display:flex;-webkit-box-align:center;-ms-flex-align:center;align-items:center;font-size:inherit}.elementor-widget .elementor-icon-list-icon+.elementor-icon-list-text{-ms-flex-item-align:center;align-self:center;padding-left:5px}.elementor-widget .elementor-icon-list-icon{display:-webkit-box;display:-ms-flexbox;display:flex}.elementor-widget .elementor-i