lementor-icon-list-items{-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end}.elementor-widget.elementor-mobile-align-right .elementor-icon-list-item,.elementor-widget.elementor-mobile-align-right .elementor-icon-list-item a{-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end;text-align:right}.elementor-widget:not(.elementor-mobile-align-right) .elementor-icon-list-item:after{left:0}.elementor-widget:not(.elementor-mobile-align-left) .elementor-icon-list-item:after{right:0}}<br />\n<br />\n										Belső és külső használatra<br />\n<br />\n<br />\n										Légcsatornás<br />\n<br />\n<br />\n										Ívre hajtott kivitel<br />\n<br />\n<br />\n			/*! elementor - v3.6.1 - 23-03-2022 */<br />\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=&amp;#34;.svg&amp;#34;]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}<br />\n		A karbon fólia kültéri és beltéri felhelyezésre is alkalmasA karbon fóliák UV és időjárás állóak, így külső és belső optikai tuningra is alkamas.Külső hazsnálatra leggyakrabban a tükröket, díszléceket és a tetőt szokták bevonni karbo fóliával.A beltérben a műszerfal az ajtóbehúzók vagy bármilyen alkatrész bevonható karbonnal.<br />\n<br />\n		Könnyen felhelyezhetőA karbon fóliák légcsatornásak, így könnyen házilag is felrakhatóak.A felrakás során melegíthető és így könnyebben alakítható az adott elem formájához. A karbon mintát a nyújtás és melegítés hatására sem veszíti el<br />\n<br />\n<br />\n', 'Karbon fólia fekete 30x150cm', '', '', '', 'karbon-folia-fekete-30x150cm'),
(2500, '', 'Karbon fólia ezüst 30x150cmA karbon fóliák az elmúlt években hatalmas népszerűségre tettek szert az autótuning világában. A külső és belső elemek optikai tuningjára is használható. Teljes autókat és belső tereket vagy csak egy egy elemet is be lehet vele vonni és rengeteget dob az autó megjelenésén.A fólia felhelyezése igényel némi rutint, de könnyen bele lehet jönni és házilag is felrakható. A karbon fólia légcsatornás kialakítású, így az esetlegesen fólia alatt maradt buborékokat sokkal könnyebb kinyomni alóla. Vastagsága: 90micron<br />\nHőállóság: -38C-110C<br />\nRagasztó típusa: Akril ragasztó<br />\n<br />\n<br />\n										Belső és külső használatra<br />\n<br />\n<br />\n										Légcsatornás<br />\n<br />\n<br />\n										Ívre hajtott kivitel<br />\n<br />\n<br />\n<br />\n		A karbon fólia kültéri és beltéri felhelyezésre is alkalmasA karbon fóliák UV és időjárás állóak, így külső és belső optikai tuningra is alkamas.Külső hazsnálatra leggyakrabban a tükröket, díszléceket és a tetőt szokták bevonni karbo fóliával.A beltérben a műszerfal az ajtóbehúzók vagy bármilyen alkatrész bevonható karbonnal.<br />\n<br />\n		Könnyen felhelyezhetőA karbon fóliák légcsatornásak, így könnyen házilag is felrakhatóak.A felrakás során melegíthető és így könnyebben alakítható az adott elem formájához. A karbon mintát a nyújtás és melegítés hatására sem veszíti el<br />\n<br />\n<br />\n', 'Karbon fólia ezüst 30x150cm', '', '', '', 'karbon-folia-ezust-30x150cm'),
(2501, '', 'Mikroszálas törlőkendő 50*70cm<br />\nA mikroszálas törlőkendők manapság igen elterjedtek, mivel anyaguknak köszönhetően sokkal könnyebb és környezetbarátabb módon lehet velük tisztítani.<br />\n<br />\nKimondottan autóápolásra lett kialakítva ez a törlőkendő. Az autó belső és külső takarítására is használható.<br />\n<br />\nA mikroszálas kendőknél egy fontos adat a gsm szám, amely megmutatja hogy az adott anyag milyen sűrű, milyen jó a nedvszívó képessége. Ennek a kendőnek az értéke 1600gsm, így kiváló nedvszívó képességű.<br />\n<br />\nExtra puha és sűrű anyagú így az érzékenyebb belső elemeket is lehet vele tisztítani. Illetve kiváló mosás utáni szárításhoz is.<br />\n<br />\nKijelzőket, műszerfalat és akár magasfényű belső díszléceket is átlehet vele törölgetni. Felold és magába szív minden szennyeződést és zsíros foltot.', 'Mikroszálas törlőkendő extra puha 50*70cm', '', '', '', 'mikroszalas-torlokendo-extra-puha-50*70cm'),
(2502, '', 'Cápa antenna fekete színbenEz az antenna úgy lett megtervezve, hogy az autó eredeti antennáját eltakarja de továbbra is erős jelet biztosítsonA belseje teljes mértékben üreges, így a nagyobb antenna talpak is beleférnekBekötése és felszerelése igazán egyszerű, a régi antenna szárat lekell tekerni majd a mellékelt új adapterszárat be csavarni az antenna talpba, ezután a cápa antennát csak felkell ragasztani a helyéreA rádió jelet az antenna belsejébe épített antenna segítiAz antenna rögzítése méretre vágott kétoldalú ragasztóval történik. A leragasztás után nem ázik be, magasnyomású mosót is bírjaAz antenna felszereléséről készítettünk egy videót is segítségképpen. Az antenna méretei:<br />\nMagassága:6.5cm<br />\nSzélessége:7.5cm<br />\nHossza:16cmBelső méretek:<br />\nszélesség:5.5cm<br />\nhossz:10cmAz antenna felszereléséről készítettünk egy videót is segítségképpen. <br />\n<br />\n<br />\n										A régi antennát elkell távolítani<br />\n<br />\n<br />\n										A cápa antenna csatlakozóját oda kell fogatni a mellékelt csavarral az antenna talphoz<br />\n<br />\n<br />\n										A kétoldalú ragasztóval fel kell ragasztani az antennát<br />\n<br />\n<br />\n		, modern megjelenés!A cápa antenna sportos és modern megjelenést biztosít minden autónak.A felülete fényes, jó minőségű kialakítással.Az antenna belseje üreges, így nagyobb antenna talpakat is eltud takarni.<br />\n<br />\n		Beépített antenna panellel rendelkezikA rádió jelet az burkolat belsejébe épített antenna segíti. <br />\n<br />\n		A cseréje nagyon egyszerű,házilag is könnyen megoldható!Bekötése és felszerelése igazán egyszerű, a régi antenna szárat lekell tekerni majd a mellékelt új adapterszárat be csavarni az antenna talpba, ezután a cápa antennát csak felkell ragasztani a helyére<br />\n<br />\n		További elérhető színek: ', 'Cápa antenna fekete', '', '', '', 'capa-antenna-fekete'),
(2503, '', 'K2 kárpit és textil tisztító spray<br />\nUniverzális kárpit és textil tisztító spray, amely szinte minden felületre használható. Vinyl felületek, Velúr kárpitok , Textil kárpitok, és akár autószőnyegek is tisztíthatóak vele.<br />\n<br />\nHatékonyan old fel minden szennyeződést, zsír, olaj és szervesanyag foltokat is.<br />\n<br />\nElsősorban autókozmetikázáshoz lett kifejlesztve, de természetesen bármilyen más területen is lehet használni. Ülőgarnitúrák, kanapék padlószőnyegek tisztítására is ugyanúgy alkalmas.<br />\n<br />\nKellemes illatot hagy maga után, fel frissíti a kitisztított anyagokat.<br />\n<br />\nHasználata egyszerű és kényelmes.<br />\nA kárpittisztítót a felületre kell permetezni, majd pár perc várakozás után kárpit tisztítókefével vagy mikroszálas ronggyal át kell dörzsölni.<br />\n<br />\nA szennyeződés mértékétől függően ez többször megismételhető.<br />\n<br />\nŰrtartalom:750ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 750ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a kárpit tisztító szert?<br />\nAz autó kárpitjai gyakran foltosak, koszosak lesznek a napi használattól. Ehhez lett kifejlesztve ez a kárpit tisztító szer. Könnyedén feloldja a szövetekbe ragadt koszt és foltokat.<br />\n<br />\nA kárpitok általános felfrissítésére is alkalmas.<br />\nHogyan kell használni a kárpit tisztító szert?<br />\n<br />\n<br />\n 	A használata elött érdemes kiporszivózni a szövetet<br />\n 	A kárpit tisztítóval be kell permetezni a tisztítandó felületet<br />\n 	Pár perc után átkell dörzsölni egy kárpit tisztító kefével vagy mikroszálas ronggyal<br />\n 	Többször megismételhető a folyamat<br />\n', 'Kárpit és textil tisztító spray', '', '', '', 'karpit-es-textil-tisztito-spray'),
(2504, '', ' Felni tisztító spray<br />\nA K2 autóápolási termékcsalád felni tisztító készítménye a K2 Felix. Ez egy elsősorban alufelnikhez kifejlesztett tisztítószer.<br />\n<br />\nKönnyen és kíméletesen felold minden felnire tapadt szennyeződést. Így elkerülhető, hogy erőteljesen kelljen kefékkel tisztítani a felnit.<br />\n<br />\nA lerakodott fékport is maradéktalanul feloldja. A felnit alaposan be kell permetezni vele, a szer másodperceken belül elkezd hatni. A feloldott kosz elválik a felni felületétől és könnyedén lemosható róla.<br />\n<br />\nHa nagyon koszos a felni akkor többször is lehet alkalmazni, illetve felni tisztító ecset használata ajánlott. Ezzel belehet juttatni mindenhova a szert illetve az erőteljesebben letapadt részeket is fellazítja.<br />\n<br />\nÖsszetételének köszönhetően az alapos tisztítás után is taszítja a port és szennyeződéseket, nehezebben koszolódik be újra a felni.<br />\n<br />\nAlufelni és lemezfelni tisztítására is alkalmas, nincs maró hatása!<br />\n<br />\nŰrtartalma:700ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 700ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a felni tisztító szert?<br />\nAlufelni és lemezfelni teljeskörű tisztítására is alkalmas, nincs maró hatása!<br />\n<br />\nKönnyedén feloldja a felnire tapadt fékport és szennyeződéseket.<br />\nHogyan kell használni a műanyag ápoló és felújító szert?<br />\n<br />\n<br />\n 	Egyenletesen be kell fújni a felni felületét<br />\n 	4-5percig kell fent hagyni, amíg kifejti hatását<br />\n<br />\nÉrdemes felni tisztító kefével áttörölni, hogy az erőteljesebb kosz réteg is fellazuljon<br />\n<br />\n<br />\nEzután lemosható a szer<br />\n<br />\n 	Többször megismételhető a folyamat<br />\n', 'Felni tisztító spray', '', '', '', 'felni-tisztito-spray-1'),
(2505, '', 'Műanyag tisztító spray K2 Oskar<br />\nA K2 Oskar a műanyag elemek tisztítására lett kifejlesztve. Az erőteljes szennyeződéseket is képes feloldani és eltávolítani a műanyag felületekről.<br />\n<br />\nSpeciális összetételének köszönhetően UV védő réteggel látja el a kezelt felületet.<br />\n<br />\nŰrtartalom: 750ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 750ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nHogyan kell használni a műanyag tisztító szert?<br />\n<br />\n<br />\n 	A gumiápolót a szórófejjel egyszerűen be kell permetezni, pár percig rajta hagyni a felületen.<br />\n 	Ezt követően átkell törölni a gumi felületét, hogy a felesleg lekerüljön róla.<br />\n 	Többször megismételhető a folyamat<br />\n', 'Műanyag tisztító spray K2 Oskar', '', '', '', 'muanyag-tisztito-spray-k2-oskar'),
(2506, '', ' Felni tisztító spray K2 Roton <br />\nA K2 Roton felni tisztító spray aktív hatóanyagokkal rendelkezik, így nagyon hatékonyan old fel minden szennyeződést.<br />\n<br />\nA felnire permetezve reakcióa lép a fékporral és a letapadt szennyeződésekkel és áttetsző színből átvált vörösre.<br />\n<br />\nAmikor már teljesen átváltott vörösre akkor leöblíthető a szer.<br />\n<br />\nKönnyen és kíméletesen felold minden felnire tapadt szennyeződést. Így elkerülhető, hogy erőteljesen kelljen kefékkel tisztítani a felnit.<br />\n<br />\nA lerakodott fékport is maradéktalanul feloldja. A felnit alaposan be kell permetezni vele, a szer másodperceken belül elkezd hatni. A feloldott kosz elválik a felni felületétől és könnyedén lemosható róla.<br />\n<br />\nHa nagyon koszos a felni akkor többször is lehet alkalmazni, illetve felni tisztító ecset használata ajánlott. Ezzel belehet juttatni mindenhova a szert illetve az erőteljesebben letapadt részeket is fellazítja.<br />\n<br />\nÖsszetételének köszönhetően az alapos tisztítás után is taszítja a port és szennyeződéseket, nehezebben koszolódik be újra a felni.<br />\n<br />\nAlufelni és lemezfelni tisztítására is alkalmas, nincs maró hatása!<br />\n<br />\nŰrtartalma:700ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 700ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a felni tisztító szert?<br />\nAlufelni és lemezfelni teljeskörű tisztítására is alkalmas, nincs maró hatása!<br />\n<br />\nKönnyedén feloldja a felnire tapadt fékport és szennyeződéseket.<br />\nHogyan kell használni a felnitsztító szert?<br />\n<br />\n<br />\n 	Egyenletesen be kell fújni a felni felületét<br />\n 	4-5percig kell fent hagyni, amíg kifejti hatását<br />\n<br />\nÉrdemes felni tisztító kefével áttörölni, hogy az erőteljesebb kosz réteg is fellazuljon<br />\n<br />\n<br />\nEzután lemosható a szer<br />\n<br />\n 	Többször megismételhető a folyamat<br />\n<br />\n<br />\n<br />\n', 'Felni tisztító spray K2 Roton', '', '', '', 'felni-tisztito-spray-k2-roton'),
(2507, '', 'LCD és kijelző tisztító spray<br />\nEgyre több autóban található meg valamilyen kijelző, legyen szó akár a multimédiáról akár a navigációs eszközök kijelzőiről.<br />\n<br />\nÓhatatlanul is össze lesz fogdosva és beporosodik a kijelzője, így szükségessé válik a tisztításuk. Ehhez fejlesztette ki a K2 csapata a kijelző tisztító sprayt.<br />\n<br />\nA használata nagyon egyszerű, a pumpás szórófejjel egy mikroszálas törlőkendőre kell fújni és ezzel áttörölni a kijelzőket.<br />\n<br />\nNem csíkoz, nem hagy nyomot a felületen, a tisztítószer elpárolog használat után.<br />\n<br />\nHasználható bármilyen kijelzőhöz, legyen szó akár TV-ről, Laptopokról vagy akár mobiltelefonokról.<br />\n<br />\nŰrtartalom: 250ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 250ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a szélvédő és üveg tisztító  szert?<br />\nHasználható bármilyen kijelző szakszerű tisztításához. Használatával elkerülhető a kijelzők megkarcolása.<br />\n<br />\nCsíkmentesen szárad, nem hagy foltokat maga után.<br />\nHogyan kell használni a szélvédő és üveg tisztító  szert?<br />\n<br />\n<br />\n 	A tisztítót az tisztítandó felületekre vagy egy mikroszálas kendőre kell permetezni<br />\n 	Ezt követően átkell törölni a felületét, hogy a felesleg lekerüljön róla.<br />\n 	Többször megismételhető a folyamat<br />\n', 'LCD és kijelző tisztító spray', '', '', '', 'lcd-es-kijelzo-tisztito-spray'),
(2508, '', 'Műanyagápoló és felújító spray K2 MATT, SZILIKONMENTES<br />\nA K2 Polo ápolja és tisztítja a műanyag elemeket, anélkül hogy fényes felületet hagyna maga után.<br />\n<br />\nSpeciális összetételének köszönhetően UV védő réteggel látja el a kezelt felületet. A termék szilikonemntes!<br />\n<br />\nA benne található összetevők felfrissítik  a műanyag elemeket, és visszaadják a színét. Használható belső elemekre is mint például a műszerfal és az ajtópanelek, de külső használatra is megfelelő. A lökhárítók, tükör körüli műanyagok és díszlécek felújítására is alkalmas.<br />\n<br />\nŰrtartalom: 770ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 770ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a műanyag ápoló és felújító szert?<br />\nA szer használható a jó állapotú műanyagok ápolására és tisztítására, illetve használható a már kopott és elöregedett műanyagok felújítására, felfrissítésére.<br />\n<br />\nKülső és belső elemekre is használható.<br />\n<br />\nPéldául a műszerfal és az ajtópanelek felülete lökhárítók, tükör körüli műanyagok és díszlécek felújítására is alkalmas.<br />\nHogyan kell használni a műanyag ápoló és felújító szert?<br />\n<br />\n<br />\n 	A használata elött alaposan le kell takarítani a gumikat, és leszárítani.<br />\n 	A gumiápolót a szórófejjel egyszerűen be kell permetezni, pár percig rajta hagyni a felületen.<br />\n 	Ezt követően átkell törölni a gumi felületét, hogy a felesleg lekerüljön róla.<br />\n 	Többször megismételhető a folyamat<br />\n', 'Műanyag ápoló és felújító spray K2 matt', '', '', '', 'muanyag-apolo-es-felujito-spray-k2-matt'),
(2509, '', 'Autókozmetikai ecset puha sörtésKiváló minőségű autókozmetikai ecset természetes sörtékből. Egy alapos autótakarításnál jól jöhetnek a különböző részletező ecsetekEz a köralakú természetes sörtés kefe tökéletes megoldás arra, hogy mindent tökéletesen letakarítsA műszerfal és a belső elemek nehezen elérhető részeihez és például a felni minden részéhez használható A belső műanyag elemeket, illetve kijelzőket sem karcolja összeBelső takarításhoz érdemes egy általános tisztítószert alkalmazni, a felni mosáshoz pedig egy profi felni tisztító spray-t. Méret: 16, átmérő: 31mm, sörte hossz: 44mm, teljes hossz: 23cm.<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Sűrű, puha sörtékkel<br />\n<br />\n<br />\n										Tökéletesen megtisztítja a legapróbb részleteket is<br />\n<br />\n<br />\n		Mire lehet használni a tisztító ecsetet?Ez a köralakú természetes sörtés kefe tökéletes megoldás arra, hogy mindent tökéletesen letakaríts.<br />\n<br />\nA műszerfal és a belső elemek nehezen elérhető részeihez és például a felni minden részéhez használható<br />\n<br />\n<br />\n<br />\n		A z ecsetet már csomagban is megvásárolhatod nálunk!&amp;nbsp;', 'Autókozmetikai ecset puha sörtés', '', '', '', 'autokozmetikai-ecset-puha-sortes'),
(2510, '', ' Felni tisztító spray K2 Roton Pro<br />\nA K2 Roton Pro az előző K2 felni tisztítók egy tovább fejlesztett változata.<br />\n<br />\nErőteljesebb hatású mint az előző szériák, és kellemes Cseresznye illatú. Gél állagú , így még jobban bevonja a felnik és a fékek felületét a tisztítás során.<br />\n<br />\nAktív hatóanyagokkal rendelkezik, így nagyon hatékonyan old fel minden szennyeződést.<br />\n<br />\nA felnire permetezve reakcióa lép a fékporral és a letapadt szennyeződésekkel és áttetsző színből átvált vörösre.<br />\n<br />\nAmikor már teljesen átváltott vörösre akkor leöblíthető a szer.<br />\n<br />\nKönnyen és kíméletesen felold minden felnire tapadt szennyeződést. Így elkerülhető, hogy erőteljesen kelljen kefékkel tisztítani a felnit.<br />\n<br />\nA lerakodott fékport is maradéktalanul feloldja. A felnit alaposan be kell permetezni vele, a szer másodperceken belül elkezd hatni. A feloldott kosz elválik a felni felületétől és könnyedén lemosható róla.<br />\n<br />\nHa nagyon koszos a felni akkor többször is lehet alkalmazni, illetve felni tisztító ecset használata ajánlott. Ezzel belehet juttatni mindenhova a szert illetve az erőteljesebben letapadt részeket is fellazítja.<br />\n<br />\nÖsszetételének köszönhetően az alapos tisztítás után is taszítja a port és szennyeződéseket, nehezebben koszolódik be újra a felni.<br />\n<br />\nAlufelni és lemezfelni tisztítására is alkalmas, nincs maró hatása!<br />\n<br />\nŰrtartalma: 1Liter<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 1L kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\nMire lehet használni a felni tisztító szert?<br />\nAlufelni és lemezfelni teljeskörű tisztítására is alkalmas, nincs maró hatása! Könnyedén feloldja a felnire tapadt fékport és szennyeződéseket.<br />\n<br />\nAutómosás elött általános röprozsda és fémtörmelék eltávolítására. A karosszériát be kell permetezni vele, és a feltapadt fémes részecskékkel reackióba lépve bevörösödik és feloldja.<br />\nHogyan kell használni a műanyag ápoló és felújító szert?<br />\n<br />\n<br />\n 	Egyenletesen be kell fújni a felni felületét<br />\n 	4-5percig kell fent hagyni, amíg kifejti hatását<br />\n<br />\nÉrdemes felni tisztító kefével áttörölni, hogy az erőteljesebb kosz réteg is fellazuljon<br />\n<br />\n<br />\nEzután lemosható a szer<br />\n<br />\n 	Többször megismételhető a folyamat<br />\n<br />\n<br />\n<br />\n', 'Felni tisztító spray K2 Roton Pro', '', '', '', 'felni-tisztito-spray-k2-roton-pro'),
(2511, '', 'K2 APC Strong Pro univerzális tisztítószer<br />\nA K2 APC Strong Pro egy rendkívül erős univerzális tisztítószer. Az autó külső illetve belső tisztításához is használható. Szinte minden felülethez alkalmas, legyen szó gumiról, műanyag elemekről, textilkárpitokról, vagy akár bőr felületekről. Erősebb koncentrációban kiváló választás motortér tisztításra is.<br />\nEgyedi összetevőinek köszönhetően eltávolítja a legmakacsabb szennyeződéseket is.<br />\nA kellemetlen szagokat is kiszedi a kárpitokból. Az APC biztonságosan használható, nem hagy foltokat maga után és eltávolítja a tisztított felületről a kellemetlen szagokat is.<br />\nKoncentrátum, így higítani kell a használat elött. A szennyeződés mértékének megfelelően kell higítani.<br />\nBelső használat: Kárpitok,Szőnyegek,Műszerfal,Bőrkárpitok, gumifelületek stb<br />\nKülső használat: Motortér tisztítás, karosszéria tisztítása. Előmosáshoz is használható! Ezenkívül motortér, alváz, gumik stb is tisztítható vele.<br />\nHasználati útmutató:<br />\n<br />\nErőteljes szennyeződések esetén 1:10 arányú oldatot kell készíteni belőle. Enyhe szennyeződések esetén elegendő 1:80 arányban bekeverni.<br />\n<br />\nA tisztítandó felületre külön szórófejes palackbe töltve lehet permetezni, de mi inkább az ecsettel vagy mikroszálas kendővel való felhordást ajánljuk.<br />\n<br />\nA felhordás után érdemes pár percig hagyni, hogy elkezdjen dolgozni az APC Strong Pro.<br />\n<br />\nTextilek tisztítása esetén kárpit tisztító kefével dolgozzuk be a szövetekbe, ezt követően mikroszálas kendővel töröljük le, vagy porszívozzuk ki.<br />\n<br />\nMűszerfal, műanyag elemek tisztítása esetén hordjuk fel egy ecsettel, vagy mikroszálas kendővel a szert. Ezt követően körkörös mozdulatokkal kezdjük el áttörölni a tisztítandó felületet.<br />\nHa már elegendő koszt oldott fel az APC Strong Pro, akkor töröljük át egy új tiszta ronggyal.<br />\n<br />\nBőr kárpitok tisztítása esetén hordjuk fel egy ecsettel, vagy mikroszálas kendővel a szert. Ezt követően körkörös mozdulatokkal kezdjük el áttörölni a tisztítandó bőrfelületet.<br />\nHa már elegendő koszt oldott fel az APC Strong Pro, akkor töröljük át egy új tiszta ronggyal.<br />\n<br />\nSzükség esetén többször meg kell ismételni a lépéseket.<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 1 literes kiszerelés<br />\n 	Higítható koncentrátum<br />\n<br />\nMire lehet használni az APC univerzális tisztító szert?<br />\nSzinte minden tisztítási munkához használható, univerzális szer. Az autó belső és külső elemeit is hatékonyan megtisztítja a makacs szennyeződésektől.<br />\n<br />\nKoncentrátum így szükséges higítva használni.<br />\nHogyan kell használni a műanyag ápoló és felújító szert?<br />\n<br />\n<br />\n 	Megfelelő erősségű oldatot kell készíteni<br />\n 	Fel kell hordani a tisztítandó felületre<br />\n<br />\nBe kell dolgozni a felületbe, és hagyni kell pár percet hatni<br />\n<br />\n<br />\nEzután lemosható a szer<br />\n<br />\n 	Többször megismételhető a folyamat<br />\n<br />\n<br />\n<br />\n', 'APC Strong Pro univerzális tisztítószer', '', '', '', 'apc-strong-pro-univerzalis-tisztitoszer'),
(2512, '', 'Aktív habos autó sampon K2 BELA PRO<br />\n<br />\nA K2 Pro sorozat tagja a Bela Pro amely aktív hab ként előmosáshoz használható.<br />\n<br />\nSemleges pH-értékkel rendelkezik, de koncentrált és kíméletlen megoldás a szennyeződések ellen. Még a legmakacsabb szennyeződéseket is felpuhítja és ezt követően könnyedén le lehet mosni.<br />\n<br />\nElőtisztításhoz használva csökkenti a festék megkarcolódásának kockázatát az elősmosást követő kézi tisztítás során. Otthoni használatra és autókozmetikáknak is megfelelő szer!<br />\n<br />\nLátványos erőssége ellenére nem hagy lerakódást vagy foltot a karosszérián.<br />\n<br />\nEnergí Fruit illatú a hab, így az autómosás során végig kellemes illatban töltheted az időd.<br />\n<br />\nHasználat:<br />\n<br />\nA termék használatához hab adagolóra van szüksége, kézi vagy magasnyomású mosóból.<br />\n<br />\n1. Higítással oldatot kell készíteni a szerből.<br />\n<br />\n• kézi hab adagolók esetén - 1:400-ra<br />\n<br />\n• nagynyomású mosóhab adagoló esetén - 1:10 - 1:15.<br />\n<br />\n2. Vigyen fel habot az autóra egy hab adagoló segítségével, a karosszéria aljától kezdve.<br />\n<br />\n3. Várjon néhány percet, amíg a hab leülepszik, és felpuhítja a szennyeződéseket.<br />\n<br />\n4. Magasnyomású mosóval mossa le a habot.<br />\n<br />\n5. Ezt követően megkezdheted a kézi mosást!<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 1 Literes kiszerelés<br />\n 	Vissza zárható kupakkal<br />\n<br />\n/*! elementor - v3.6.5 - 27-04-2022 */<br />\n<br />\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=&amp;#34;.svg&amp;#34;]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}<br />\n<br />\n<br />\n<br />\n', 'Autósampon aktív habos Bela Pro', '', '', '', 'autosampon-aktiv-habos-bela-pro'),
(2513, '', 'K2 Nuta Anti Insect Pro bogár eltávolító spray 1L<br />\nA K2 NUTA Anti Insect PRO egy professzionális, biztonságos és azonnal használható szer a rovarmaradványok eltávolítására az autófestékek, lökhárítók, tükrök és fényszórók felületéről.<br />\n<br />\nIdeális a rovarok szélvédőkről való eltávolítására. A készítmény nem hagy esélyt a beszáradt rovarmaradványoknak. Az aktív tisztítószerek reakcióba lépnek a fehérjékkel és a rovarok kitinpáncéljával és hatékonyan leválasztják azokat a tisztított felületről.<br />\n<br />\nA K2 NUTA Anti Insect Pro ideális a madárürülék és egyéb szerves szennyeződések eltávolítására is.<br />\n<br />\nA K2 NUTA Anti Insect PRO használatának köszönhetően elkerülheti a fárasztó súrolást és a rovarok lekaparását a lakkról, így minimálisra csökkentve a lakk megkarcolódásának kockázatát.<br />\n<br />\nTeljesen biztonságos minden felületre, pl. lakk, gumi, műanyag. Nem érinti a védőbevonatokat, pl. viaszokat, kerámiabevonatokat.<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 1000ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\n<br />\n<br />\n', 'K2 Nuta Anti Insect Pro bogár eltávolító spray 1L', '', '', '', 'k2-nuta-anti-insect-pro-bogar-eltavolito-spray-1l'),
(2514, '', 'Bőrápoló és regeneráló szer K2 Letan<br />\nA K2 termékcsalád bőrápolásra fejlesztette ki a Letan nevű termékét. A termék színtől függetlenül alkalmas minden bőrfelület megtisztítására és ápolására.<br />\n<br />\nA benne található finom szemcsék eltávolítják a bőr felületére tapadt szennyeződéseket. A további összetevőknek köszönhetően impregnálja a bőrt és megvédi a kiszáradástól.<br />\n<br />\nHa rendszeresen kezelve vannak a bőrülések és bőrkárpitok, akkor elkerülhető a repedezésük, és hosszútávon is kellemes puha tapintású marad a felületük.<br />\n<br />\nNem csak bőrülések és kárpitok de bármilyen más bőr anyagú termék tisztítására is kiválóan alkalmas. Akár táskákról kabátokról van szó, használható a bőrápoló.<br />\n<br />\nA készítmény kellemes &amp;#34;új bőr&amp;#34; illatot ad a tisztított felületnek.<br />\n<br />\nA használata egyszerű és kényelmes. A bőrápolót egy mikroszálas törlőkendőre kell nyomni majd ezzel áttörölni a bőr felületet. Szükség szerinte ez többször megismételhető.<br />\nA nagyobb igénybevételű bőr kárpitoknál mint a könyöklő illetve az ülések, érdemes bőr tisztító kefével is átdolgozni a felületet, hogy fellazítson minden szennyződést.<br />\nNagyobb felületeken érdemes közvetlenül a bőrre is juttani a szerből és így áttörölni.<br />\n<br />\nŰrtartalom: 250ml<br />\n<br />\n 	Könnyen használható!<br />\n 	Kiadós 250ml kiszerelés<br />\n 	Vissza zárható szórófejjel<br />\n<br />\n<br />\n<br />\n', 'Bőrápoló és regeneráló szer', '', '', '', 'borapolo-es-regeneralo-szer'),
(2515, '', 'K2 Express Plus Autósampon koncentrátum Carnauba viasz tartalommalRendkívül hatékony, erősen koncentrált autósampon ami felold és eltávolít minden szennyeződést. Általános szennyeződések, rovar maradványok, madárürülék és akár kátrány maradványokat is képes feloldani.A termék koncentrátum, tehát kevesebb kell belőle egy mosáshoz mint a sima autósamponokból. Öt liter vízhez mindössze 3-4 kupaknyi koncentrátumot kell adagolni, de ez igényre szabva változtatható.Az autósampon Carnauba Viasz tartalmú, így a mosést követően cseppmentesen szárad és egy víztaszító fényes réteget képez a karosszérián.Az általános szennyeződéseken kívül hatásos rovar maradványok, madárürülék és mindenféle zsír illetve növényi nedv ellen.Űrtartalom: 1liter<br />\n<br />\n<br />\n										Könnyen használható!<br />\n<br />\n<br />\n										Kiadós 1 Literes kiszerelés<br />\n<br />\n<br />\n										Vissza zárható kupakkal<br />\n<br />\n', 'Autósampon koncentrátum Carnauba viasz tartalommal', '', '', '', 'autosampon-koncentratum-carnauba-viasz-tartalommal'),
(2516, '', 'K2 AURON BRUSH tisztító  kefe<br />\nPuha sörtés kefe, amelyet a bőr vagy szövet kárpitok finom felületének tisztítására terveztek<br />\n<br />\nKiváló minőségű anyagokból készült, szilárd és tartós szerkezettel.<br />\n<br />\nTökéletesen tisztít, elérve a bőr minden részét és mélyedését. Nem károsítja a bőrfelületet és nem hagy csíkokat. Tökéletesen illik a kezedbe.<br />\n<br />\n 	Könnyen használható!<br />\n 	Sűrű, puha sörtékkel<br />\n 	Tökéletesen megtisztítja a bőrkárpitok felületét<br />\n<br />\nMire lehet használni a bőr kárpit tisztító kefét?<br />\nAz autóban megtalálható bőrkárpitokat, műszerfalat kormányt és egyéb kiegészítőket lehet megfelelően letisztítani.<br />\n<br />\nA kefe puha sörtéi kíméletesen oldják fel a letapadt koszt, és nem sértik fel a bőr felületét. A megfelelő bőrtisztító és ápoló szereket szépen egyenletesen fel lehet hordani a tisztítandó felületre.<br />\nHogyan kell használni a bőr tisztító kefét?<br />\n<br />\n<br />\n 	A tisztító szert a bőr felületre kell permetezni, illetve a kefe sörtéire<br />\n 	Körkörös finom mozdulatokkal dolgozzuk el a tisztító szert<br />\n 	Pár perc után letörölthető a tisztítsószer és a feloldott szennyeződések<br />\n 	Többször megismételhető a folyamat<br />\n<br />\nA  bőr tisztító kefét már csomagban is megvásárolhatod nálunk! ', 'Bőr tisztító kefe', '', '', '', 'bor-tisztito-kefe-1'),
(2517, '', 'Autómosó szivacsKézi mosáshoz elengedhetetlen a jó minőségű szivacsEz a típus puha de tömött kialakítású, így jól fellehet vele vinni a tisztítószert. Erőteljesen habzást lehet vele elérni, nem karcolja meg a fényezést22x10cm felületű és 5cm vastag', 'Autómosó szivacs', '', '', '', 'automoso-szivacs'),
(2518, '', 'Autóüveg sötétítő fólia A sötétítő fóliáknak több előnye is van amiért érdemes használni őket.Az autóablak sötétítő fóliák optikailag is sportosabbá teszik az autót és emellett védelmet is biztosít a nap káros hatásai ellen.A fóliázott ablakokon nem lehet belátni, így nem látni a bent hagyott értékeket, táskát lapopot stb.-t. Így elkerülhető hogy emiatt törjék fel az autót. A fizikai védelem mellett szól az az érv is, hogy a fóliázott üveget nehezebb betörni, illetve baleset során a széttört üveget rögzíti a fólia.<br />\nAz UV sugárzást szintén gátolja az ablakfólia, visszaveri a napsugárzást. Így nehezebben melegszik fel az autó beltere, illetve a műanyag elemek nem kapnak olyan mértékű UV sugárzást mint fólia nélkül. Így lassabban öregszik az anyaga a beltérnek.A mérete 300*75cm tehát akár hátsó ablakra is megfelelő szélességű<br />\n<br />\n<br />\n										Könnyen,házilag is felrakható!<br />\n<br />\n<br />\n										300x75cm méretű<br />\n<br />\n<br />\n										UV álló anyagból<br />\n<br />\n<br />\n		Sötét fekete színA fólia erősségét, százalékban tüntetik fel a fóliák esetében. Ennek a fóliának a fényáteresztő képessége: 5%A lehető legsötétebb (fekete) ablak fólia, mindössze 5% a fényáteresztéseAz ablakfólia az optikai tuning mellett a védelem szempontjából is hasznos.<br />\n<br />\n		Könnyedén felrakható házilag is!Az autó szélvédőit alaposan le kell takarítani üveg tisztítóval.Ezt követően a fóliát be kell vizezni és felhelyezni az adott üvegre kívűlről. Így könnyen méretre lehet vágni a fóliát.Ha meg van a méret, akkor a védőfóliát le kell szedni a fólia belső feléről.Be kell vizezni a fóliát és az üveg felületet is ahova felrakásra kerül.A műanyag spatulával ki kell nyomni a fólia alól a vizet. Ha valahol buborék marad, vékony tűvel ki lehet szúrni.A fólia mellett műanyag spatula és penge is van, de érdemes egy profi fólia felrakó szettet beszerezni.<br />\n<br />\n		Mihez ajánljuk az ablakfóliákat?Az ablakfóliákat bármilyen üvegfelületre fel lehet rakni. Autóüveg, lakókocsi, teherautó raktér ablak, üzletek és iroda ablakok.Ha ennél világosabb  füst fekete ablak fóliát keresel, akkor a 25%-s fóliát ajánljuk.Műbizonylattal nem rendelkezikA fóliázáshoz hasznos kiegészítők:', 'Autóüveg sötétítő fólia 5%', '', '', '', 'autouveg-sotetito-folia-5'),
(2519, '', 'Cápauszony antenna fehér színben<br />\n<br />\nLegújabb kivitelű cápauszony antenna, amelynek a kialakítása magasított és a talpa gumírozott kialakítású.<br />\nA&amp;nbsp; cápauszony antenna úgy lett megtervezve, hogy az autó eredeti antennáját eltakarja de továbbra is erős jelet biztosítson.<br />\nA belseje teljes mértékben üreges, így a nagyobb antennatalpak is beleférnek.<br />\nBekötése és felszerelése igazán egyszerű, a régi antenna szárat lekell tekerni majd a mellékelt új adapterszárat be csavarni az antennatalpba, ezután a cápa antennát csak felkell ragasztani a helyére.<br />\nA rádió jelet az antenna belsejébe épített antenna segíti<br />\nAz antenna rögzítése méretre vágott kétoldalú ragasztóval történik. A leragasztás után nem ázik be, magasnyomású mosót is bírja<br />\nAz antenna felszereléséről készítettünk egy videót is segítségképpen.&amp;nbsp;<br />\nAz antenna méretei:<br />\nMagassága:7cm<br />\nHossza:16cm<br />\nBelső méretek:<br />\nszélesség:5.3cm<br />\nhossz:10.5cm<br />\nAz antenna felszereléséről készítettünk egy videót is segítségképpen.&amp;nbsp;<br />\n<br />\nA régi antennát elkell távolítani<br />\nA cápa antenna csatlakozóját oda kell fogatni a mellékelt csavarral az antenna talphoz<br />\nA kétoldalú ragasztóval fel kell ragasztani az antennát<br />\n<br />\nSportos, modern megjelenés!<br />\nA cápa antenna sportos és modern megjelenést biztosít minden autónak.<br />\nA felülete fényes, jó minőségű kialakítással.<br />\nAz antenna belseje üreges, így nagyobb antenna talpakat is eltud takarni.<br />\n<br />\n<br />\n										A régi antennát elkell távolítani<br />\n<br />\n<br />\n										A cápa antenna csatlakozóját oda kell fogatni a mellékelt csavarral az antenna talphoz<br />\n<br />\n<br />\n										A kétoldalú ragasztóval fel kell ragasztani az antennát<br />\n<br />\n<br />\n		Sportos, modern megjelenés!A cápa antenna sportos és modern megjelenést biztosít minden autónak.A felülete fényes, jó minőségű kialakítással.Az antenna belseje üreges, így nagyobb antenna talpakat is eltud takarni.<br />\n<br />\n		Beépített antenna panellel rendelkezikA rádió jelet az burkolat belsejébe épített antenna segíti. <br />\n<br />\n		A cseréje nagyon egyszerű,házilag is könnyen megoldható!Bekötése és felszerelése igazán egyszerű, a régi antenna szárat lekell tekerni majd a mellékelt új adapterszárat be csavarni az antenna talpba, ezután a cápa antennát csak felkell ragasztani a helyére<br />\n', 'Cápauszony antenna fehér színben', '', '', '', 'capauszony-antenna-feher-szinben'),
(2520, '', 'Feszültség mérőóra<br />\nHa szeretnél folyamatosan tisztában lenni az autó pillanatnyi feszültségével, akkor ez a feszültségmérőóra nélkülözhetetlen<br />\n<br />\nAzonnali visszajelzést ad a műszer, így időben észrevehető bármilyen eltérés a normál töltéshez képest.<br />\n<br />\nAz óra átmérője 52mm, standard méret amihez tartót is árulunk, de műszerfalba is beszerelhető akár tartó nélkül is<br />\n<br />\nA háttérvilágítást erőteljes ledes fényű, így nappali fénynél és éjszaka is könnyen leolvasható a számlapja<br />\n<br />\nMivel ledes a háttérvilágítása így minimális a fogyasztása<br />\n<br />\nUniverzális termék, bármelyik autóba beszerelhető. Ehhez szükséges kiegészítőket is tartalmazza a csomag.<br />\n<br />\nAdatok:<br />\nDC 10-15V(12)<br />\nEnergia felvétel: MAX 0.3A<br />\n<br />\nA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\n 	Könnyen beszerelhető!<br />\n 	Led háttérvilágítással<br />\n<br />\nMegbízható, pontos HD mérőórák<br />\nA Hd mérőórák megbízható pontos adatokat mutatnak.<br />\n<br />\nA Rally Team USA közreműködésével fejlesztették ki mérőóráikat, hogy megfeleljen minden helyzetben.<br />\n<br />\nHa szeretnél folyamatosan visszajelzést kapni az olajnyomásról, akkor egy ilyen mérőórát szükséges beszerelned<br />\n<br />\n<br />\nKönnyen beszerelhető<br />\nA készlet tartalmazza a beépítéshez szükséges kellékeket. Az óra szabvány 52mms átmérőjű.<br />\n<br />\nA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\n', 'Feszültség mérőóra fehér számlappal', '', '', '', 'feszultseg-meroora-feher-szamlappal'),
(2521, '', 'Vízhőfok mérőóra Az autó hűtővizének hőmérséklete az egyik legfontosabb dolog amit szemmel kell tartani.. ha fel forr a víz akkor hengerfejes lehet az autó és igen költséges a javításaEzzel a műszerrel folyamatosan szemmel lehet tartani a pillanatnyi vízhőfokotAz óra átmérője 52mm, standard méret amihez tartót is árulunk, de műszerfalba is beszerelhető akárA háttérvilágítást erőteljes ledes fényű, így éjszaka is könnyen leolvasható a számlapjaMivel ledes a háttérvilágítása így minimális a fogyasztásaUniverzális termék, bármelyik autóba beszerelhető. Ehhez szükséges kiegészítőket is tartalmazza a csomagAdatok:<br />\nDC 10-15V(12)<br />\nEnergia felvétel: MAX 0.3AA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\n<br />\n										Könnyen beszerelhető!<br />\n<br />\n<br />\n										Led háttérvilágítással<br />\n<br />\n<br />\n		Megbízható, pontos HD mérőórákA Hd mérőórák megbízható pontos adatokat mutatnak. A Rally Team USA közreműködésével fejlesztették ki mérőóráikat, hogy megfeleljen minden helyzetben. Ha szeretnél folyamatosan visszajelzést kapni az olajnyomásról, akkor egy ilyen mérőórát szükséges beszerelned<br />\n<br />\n		Könnyen beszerelhetőA készlet tartalmazza a beépítéshez szükséges kellékeket. Az óra szabvány 52mms átmérőjű. A sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n', 'Vízhőfok mérőóra fehér számlappal', '', '', '', 'vizhofok-meroora-feher-szamlappal'),
(2522, '', 'Olajhőfok mérőóra<br />\nHa szeretnél folyamatosan visszajelzést kapni az olaj hőmérsékletéről, akkor egy ilyen mérőórát szükséges beszerelned<br />\n<br />\nAz autókban már egy ideje nem található meg gyárilag olajhő és nyomásmérő óra, csupán akkor jelez ha már baj van.. tehát mindenkép érdemes egy ilyet beszerelni<br />\n<br />\nAz óra átmérője 52mm, standard méret amihez tartót is árulunk, de műszerfalba is beszerelhető akár<br />\n<br />\nA háttérvilágítást erőteljes ledes fényű, így éjszaka is könnyen leolvasható a számlapja<br />\n<br />\nMivel ledes a háttérvilágítása így minimális a fogyasztása<br />\n<br />\nUniverzális termék, bármelyik autóba beszerelhető. Ehhez szükséges kiegészítőket is tartalmazza a csomag<br />\n<br />\nAdatok:<br />\nDC 10-15V(12)<br />\nEnergia felvétel: MAX 0.3A<br />\n<br />\nA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\n 	Könnyen beszerelhető!<br />\n 	Led háttérvilágítással<br />\n<br />\nMegbízható, pontos HD mérőórák<br />\nA Hd mérőórák megbízható pontos adatokat mutatnak.<br />\n<br />\nA Rally Team USA közreműködésével fejlesztették ki mérőóráikat, hogy megfeleljen minden helyzetben.<br />\n<br />\nHa szeretnél folyamatosan visszajelzést kapni az olajnyomásról, akkor egy ilyen mérőórát szükséges beszerelned<br />\n<br />\n<br />\nKönnyen beszerelhető<br />\nA készlet tartalmazza a beépítéshez szükséges kellékeket. Az óra szabvány 52mms átmérőjű.<br />\n<br />\nA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\n', 'Olajhőfok mérőóra fehér számlappal', '', '', '', 'olajhofok-meroora-feher-szamlappal'),
(2523, '', 'Turbónyomás mérőóra<br />\nFehér számlapos turbónyomás mérőóra, kék led háttérvilágítással. 2Bar nyomásig van kalibrálva.<br />\n<br />\nA szett tartalmazza a bekötéshez szükséges vákuumcsövet, és a T idomot.<br />\n<br />\nTurbonyomás méőóra adatai:<br />\n<br />\n- 52mm-es sport műszer-<br />\n<br />\n- Energiatakarékos hosszú élettartamú LED<br />\n<br />\nModern Design<br />\n<br />\n- A Rally Team USA közreműködésével tökéletesített technológia<br />\n<br />\n- DC 10-15V(12)<br />\n<br />\n- Energiafelvétel: MAX 0.3A<br />\n<br />\nA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\nA turbónyomás méőóra beszereléséről olvasd el blog cikkünk is.<br />\n<br />\n 	Könnyen beszerelhető!<br />\n 	Led háttérvilágítással<br />\n<br />\n<br />\nMegbízható, pontos HD mérőórák<br />\nA Hd mérőórák megbízható pontos adatokat mutatnak.<br />\n<br />\nA Rally Team USA közreműködésével fejlesztették ki mérőóráikat, hogy megfeleljen minden helyzetben.<br />\n<br />\nA turbonyomás mérők fekete és fehér számlappal is elérhetőek.<br />\n<br />\n<br />\nKönnyen beszerelhető<br />\nA készlet tartalmazza a beépítéshez szükséges kellékeket. Az óra szabvány 52mms átmérőjű.<br />\n<br />\nA sport műszereink mellé, a sportműszer tartót ajánljuk a kényelmes, megfelelő elhelyezés érdekében!<br />\n<br />\n', 'Turbónyomás mérőóra fehér számlapos', '', '', '', 'turbonyomas-meroora-feher-szamlapos'),
