(2532, '', 'Cápauszony antenna fekete színbenLegújabb kivitelű cápauszony antenna, amelynek a kialakítása magasított és a talpa gumírozott kialakítású.A  cápauszony antenna úgy lett megtervezve, hogy az autó eredeti antennáját eltakarja de továbbra is erős jelet biztosítson.A belseje teljes mértékben üreges, így a nagyobb antennatalpak is beleférnek.Bekötése és felszerelése igazán egyszerű, a régi antenna szárat lekell tekerni majd a mellékelt új adapterszárat be csavarni az antennatalpba, ezután a cápa antennát csak felkell ragasztani a helyére.A rádió jelet az antenna belsejébe épített antenna segítiAz antenna rögzítése méretre vágott kétoldalú ragasztóval történik. A leragasztás után nem ázik be, magasnyomású mosót is bírjaAz antenna felszereléséről készítettünk egy videót is segítségképpen. Az antenna méretei:<br />\nMagassága:7cm<br />\nHossza:16cmBelső méretek:<br />\nszélesség:5.3cm<br />\nhossz:10.5cmAz antenna felszereléséről készítettünk egy videót is segítségképpen. A régi antennát elkell távolítaniA cápa antenna csatlakozóját oda kell fogatni a mellékelt csavarral az antenna talphozA kétoldalú ragasztóval fel kell ragasztani az antennátSportos, modern megjelenés!A cápa antenna sportos és modern megjelenést biztosít minden autónak.A felülete fényes, jó minőségű kialakítással.Az antenna belseje üreges, így nagyobb antenna talpakat is eltud takarni.<br />\n<br />\n<br />\n										A régi antennát elkell távolítani<br />\n<br />\n<br />\n										A cápa antenna csatlakozóját oda kell fogatni a mellékelt csavarral az antenna talphoz<br />\n<br />\n<br />\n										A kétoldalú ragasztóval fel kell ragasztani az antennát<br />\n<br />\n<br />\n		Sportos, modern megjelenés!A cápa antenna sportos és modern megjelenést biztosít minden autónak.A felülete fényes, jó minőségű kialakítással.Az antenna belseje üreges, így nagyobb antenna talpakat is eltud takarni.<br />\n<br />\n		Beépített antenna panellel rendelkezikA rádió jelet az burkolat belsejébe épített antenna segíti. <br />\n<br />\n		A cseréje nagyon egyszerű,házilag is könnyen megoldható!Bekötése és felszerelése igazán egyszerű, a régi antenna szárat lekell tekerni majd a mellékelt új adapterszárat be csavarni az antenna talpba, ezután a cápa antennát csak felkell ragasztani a helyére<br />\n', 'Cápauszony antenne fekete', '', '', '', 'capauszony-antenne-fekete'),
